ng a serial killer known as the Riddler.','https://image.tmdb.org/t/p/w500/74xTEgt7R36Fpooo50r9T25onhq.jpg','2022-03-02',7.7,0),(16923,'Cop Secret','is','When Bússi, Iceland\'s toughest cop, is forced to work with a new partner to solve a series of bank robberies, the pressure to close the case as soon as possible proves too much for him.','https://image.tmdb.org/t/p/w500/jnWyZsaCl3Ke6u6ReSmBRO8S1rX.jpg','2022-05-23',6.3,0),(16924,'Take the Lead','en','A former professional dancer volunteers to teach dance in the New York public school system and, while his background first clashes with his students\' tastes, together they create a completely new style of dance. Based on the story of ballroom dancer, Pierre Dulane.','https://image.tmdb.org/t/p/w500/vkGSs0eeOOISEe9jddBZnRSkn46.jpg','2006-03-17',6.9,0),(16925,'Uncharted','en','A young street-smart, Nathan Drake and his wisecracking partner Victor “Sully” Sullivan embark on a dangerous pursuit of “the greatest treasure never found” while also tracking clues that may lead to Nathan’s long-lost brother.','https://image.tmdb.org/t/p/w500/rJHC1RUORuUhtfNb4Npclx0xnOf.jpg','2022-02-10',7,0),(16926,'Puss in Boots','en','Long before he even met Shrek, the notorious fighter, lover and outlaw Puss in Boots becomes a hero when he sets off on an adventure with the tough and street smart Kitty Softpaws and the mastermind Humpty Dumpty to save his town. This is the true story of The Cat, The Myth, The Legend... The Boots.','https://image.tmdb.org/t/p/w500/n4UkIqNYSTr4DPoHCVfLrL8mbre.jpg','2011-10-27',6.5,0),(16927,'On the Line','en','A provocative and edgy radio host must play a dangerous game of cat and mouse with a mysterious caller who\'s kidnapped his family and is threatening to blow up the whole station.','https://image.tmdb.org/t/p/w500/a14BbSHvLgzCdbDD6tAL8OBVKL1.jpg','2022-10-31',6.3,0),(16928,'Diary of a Wimpy Kid: Rodrick Rules','en','A new school year, his brother Rodrick teases him over and over and over and over again.