','When a meteor carrying a destructive plant strikes the world, a suicide squad is given hours to save their post-apocalyptic city from total collapse.','https://image.tmdb.org/t/p/w500/2l9LbxBSkJseoxYcIJjclnmxyq.jpg','2022-08-05',7.3,0),(17090,'After We Fell','en','Just as Tessa\'s life begins to become unglued, nothing is what she thought it would be. Not her friends nor her family. The only person that she should be able to rely on is Hardin, who is furious when he discovers the massive secret that she\'s been keeping. Before Tessa makes the biggest decision of her life, everything changes because of revelations about her family.','https://image.tmdb.org/t/p/w500/dU4HfnTEJDf9KvxGS9hgO7BVeju.jpg','2021-09-01',7.1,0),(17091,'Madagascar: A Little Wild Holiday Goose Chase','en','Melman the Giraffe meets Hank, a goose who has been separated from his family and along with his friends, they embark on a wild goose chase around the city to reunite Hank with his merry flock.','https://image.tmdb.org/t/p/w500/h6TUQegjmCafQMswFW0SgCM3JeK.jpg','2021-11-26',6.3,0),(17092,'Dog','en','An army ranger and his dog embark on a road trip along the Pacific Coast Highway to attend a friend\'s funeral.','https://image.tmdb.org/t/p/w500/zHQy4h36WwuCetKS7C3wcT1hkgA.jpg','2022-02-17',7.4,0),(17093,'Ice Age','en','With the impending ice age almost upon them, a mismatched trio of prehistoric critters – Manny the woolly mammoth, Diego the saber-toothed tiger and Sid the giant sloth – find an orphaned infant and decide to return it to its human parents. Along the way, the unlikely allies become friends but, when enemies attack, their quest takes on far nobler aims.','https://image.tmdb.org/t/p/w500/gLhHHZUzeseRXShoDyC4VqLgsNv.jpg','2002-03-10',7.3,0),(17094,'Shooter','en','A marksman living in exile is coaxed back into action after learning of a plot to kill the president. Ultimately double-crossed and framed for the attempt, he goes on the run to track the real killer and find out who exactly set him up, and why??','https://image.tmdb.org/t/p/w500/tyRP8JedrDkPPvH3JxKYsdP2esu.jpg','2007-03-22',7.1,0),(17095,'Miraculous World: New York, United HeroeZ','fr','Teen Parisian superheroes Ladybug and Chat Noir visit New York on a field trip and discover that superheroes exist in the United States too.','https://image.tmdb.org/t/p/w500/9YbyvcrHmY2SVbdfXpb8mC4Fy0g.jpg','2020-09-25',8.2,0),(17096,'Ratatouille','en','Remy, a resident of Paris, appreciates good food and has quite a sophisticated palate. He would love to become a chef so he can create and enjoy culinary masterpieces to his heart\'s delight. The only problem is, Remy is a rat. When he winds up in the sewer beneath one of Paris\' finest restaurants, the rodent gourmet finds himself ideally placed to realize his dream.','https://image.tmdb.org/t/p/w500/t3vaWRPSf6WjDSamIkKDs1iQWna.jpg','2007-06-28',7.8,0),(17097,'Godzilla vs. Kong','en','In a time when monsters walk the Earth, humanity’s fight for its future sets Godzilla and Kong on a collision course that will see the two most powerful forces of nature on the planet collide in a spectacular battle for the ages.','https://image.tmdb.org/t/p/w500/pgqgaUx1cJb5oZQQ5v0tNARCeBp.jpg','2021-03-24',7.7,0),(17098,'Big Trip 2: Special Delivery','ru','It has been a year since Mic Mic and Oscar returned from their incredible adventure. And now, after a diabolical plan by Vulture to sabotage the delivery of the Grizzly cub to his opponent in the American presidential elections, Mic Mic, Oscar, Panda teenager and Stork set off on another great adventure as they ride a zeppelin to return little Grizzly to its rightful parents and save the American elections and the whole continent from an erupting volcano.','https://image.tmdb.org/t/p/w500/dabXVfrAFfhDte8XVemom3mTJog.jpg','2022-10-07',6.4,0),(17099,'After','en','Tessa Young is a dedicated student, dutiful daughter and loyal girlfriend to her high school sweetheart. Entering her first semester of college, Tessa\'s gua