cle below.','https://image.tmdb.org/t/p/w500/i0z8g2VRZP3dhVvvSMilbOZMKqR.jpg','2022-01-28',5,0),(17225,'The Communion Girl','es','Spain, late 1980s. Newcomer Sara tries to fit in with the other teens in this tight-knit small town in the province of Tarrgona. If only she were more like her extroverted best friend, Rebe. They go out one night at a nightclub, on the way home, they come upon a little girl holding a doll, dressed for her first communion. And that\'s when the nightmare begins.','https://image.tmdb.org/t/p/w500/sP6AO11a7jWgsmT9T8j9EGIWAaZ.jpg','2023-02-10',6,0),(17226,'Elvis','en','The life story of Elvis Presley as seen through the complicated relationship with his enigmatic manager, Colonel Tom Parker.','https://image.tmdb.org/t/p/w500/qBOKWqAFbveZ4ryjJJwbie6tXkQ.jpg','2022-06-22',7.7,0),(17227,'Boyka: Undisputed IV','en','In the fourth installment of the fighting franchise, Boyka is shooting for the big leagues when an accidental death in the ring makes him question everything he stands for. When he finds out the wife of the man he accidentally killed is in trouble, Boyka offers to fight in a series of impossible battles to free her from a life of servitude.','https://image.tmdb.org/t/p/w500/7QGdIJWWTkPhVjpQ0zA6z69khod.jpg','2016-08-01',7.1,0),(17228,'Office Invasion','en','Three friends come together to defend their valuable mining company from…aliens?! What could possibly go wrong?','https://image.tmdb.org/t/p/w500/khcVwO0gwguC1CndbxtH1bzk4aj.jpg','2022-08-10',5.8,0),(17229,'Empire of Light','en','The duty manager of a seaside cinema, who is struggling with her mental health, forms a relationship with a new employee on the south coast of England in the 1980s.','https://image.tmdb.org/t/p/w500/h84SnIQF91Gz2Fv1OpMJ3245t4i.jpg','2022-12-09',5.9,0),(17230,'The Shawshank Redemption','en','Framed in the 1940s for the double murder of his wife and her lover, upstanding banker Andy Dufresne begins a new life at the Shawshank prison, where he puts his accounti