 rebellious boy, impulsive, unconscious, has a appetite for risk and danger embodied in endless fights and illegal motorbike races, the limit of common sense','https://image.tmdb.org/t/p/w500/fcFz2xEZodKOxHDn9DazxPYHDSc.jpg','2010-12-03',7.8,0),(17242,'Iron Man 2','en','With the world now aware of his dual life as the armored superhero Iron Man, billionaire inventor Tony Stark faces pressure from the government, the press and the public to share his technology with the military. Unwilling to let go of his invention, Stark, with Pepper Potts and James \'Rhodey\' Rhodes at his side, must forge new alliances – and confront powerful enemies.','https://image.tmdb.org/t/p/w500/6WBeq4fCfn7AN0o21W9qNcRF2l9.jpg','2010-04-28',6.8,0),(17243,'The Last of Us - No Escape','en','A group of survivors must fight for their lives against a horde of blood thirsty Clickers.','https://image.tmdb.org/t/p/w500/7cfbTwXFriY8vjH6zQg0O8ZgkFR.jpg','2017-01-12',5.5,0),(17244,'Spider-Man: Into the Spider-Verse','en','Miles Morales is juggling his life between being a high school student and being a spider-man. When Wilson \"Kingpin\" Fisk uses a super collider, others from across the Spider-Verse are transported to this dimension.','https://image.tmdb.org/t/p/w500/iiZZdoQBEYBv6id8su7ImL0oCbD.jpg','2018-12-14',8.4,0),(17245,'The Adam Project','en','After accidentally crash-landing in 2022, time-traveling fighter pilot Adam Reed teams up with his 12-year-old self on a mission to save the future.','https://image.tmdb.org/t/p/w500/wFjboE0aFZNbVOF05fzrka9Fqyx.jpg','2022-03-11',7.1,0),(17246,'Joker','en','During the 1980s, a failed stand-up comedian is driven insane and turns to a life of crime and chaos in Gotham City while becoming an infamous psychopathic crime figure.','https://image.tmdb.org/t/p/w500/udDclJoHjfjb8Ekgsd4FDteOkCU.jpg','2019-10-01',8.2,0),(17247,'Little Dixie','en','Erstwhile Special Forces operative Doc Alexander is asked to broker a truce with the Mexican drug cartel in secrecy. When Oklahoma Governor Richard Jeffs celebrates the execution of a high-ranking cartel member on TV, his Chief of Staff and Doc inform him about the peace he just ended. But it’s too late, as Cuco, the cartel’s hatchet man, has set his vengeful sights on Doc’s daughter Dixie.','https://image.tmdb.org/t/p/w500/cmWTZj9zzT9KFt3XyL0gssL7Ig8.jpg','2023-02-03',4.6,0),(17248,'The Amazing Spider-Man 2','en','For Peter Parker, life is busy. Between taking out the bad guys as Spider-Man and spending time with the person he loves, Gwen Stacy, high school graduation cannot come quickly enough. Peter has not forgotten about the promise he made to Gwen’s father to protect her by staying away, but that is a promise he cannot keep. Things will change for Peter when a new villain, Electro, emerges, an old friend, Harry Osborn, returns, and Peter uncovers new clues about his past.','https://image.tmdb.org/t/p/w500/c3e9e18SSlvFd1cQaGmUj5tqL5P.jpg','2014-04-16',6.5,0),(17249,'The Tomorrow War','en','The world is stunned when a group of time travelers arrive from the year 2051 to deliver an urgent message: Thirty years in the future, mankind is losing a global war against a deadly alien species. The only hope for survival is for soldiers and civilians from the present to be transported to the future and join the fight. Among those recruited is high school teacher and family man Dan Forester. Determined to save the world for his young daughter, Dan teams up with a brilliant scientist and his estranged father in a desperate quest to rewrite the fate of the planet.','https://image.tmdb.org/t/p/w500/34nDCQZwaEvsy4CFO5hkGRFDCVU.jpg','2021-07-02',7.9,0),(17250,'Deinfluencer','en','An influential cheerleader finds herself held captive by a masked psychopath with a God complex. She must complete a series of sadistic social media challenges to save her life and the lives of her fellow captives. However, the masked kidnapper has a secret agenda for his most recent victim.','https://image.tmdb.org/t/p/w500/fNY57OQlctOqcm5VshG5QOtmdlu.jpg','2022-10-01',7,0),(17251,'American Sniper','en','U.S. Navy SEAL Chris Kyle takes his sole mission—protect his comrades—to heart and becomes one of the most lethal snipers in American history. His pinpoint accuracy not only saves countless lives but also makes him a prime target of insurgents. Despite grave danger and his struggle to be a good husband and father to his family back in the States, Kyle serves four tours of duty in Iraq. However, when he finally returns home, he finds that he cannot leave the war behind.','https://image.tmdb.org/t/p/w500/vJgtfUmZE5i4L12sOryAPuBa04K.jpg','2014-12-25',7.4,0),(17252,'A Night at the Kindergarten','pl','A young man crashes a school play rehearsal to prevent a group of teachers and eccentric parents from expelling his girlfriend\'s son.','https://image.tmdb.org/t/p/w500/r6tDFLtLzlzkm27OOOsdjlK58wD.jpg','2022-12-28',5.9,0),(17253,'The Penitent Thief','en','The story of the two unnamed men who were crucified alongside Jesus and how they came to be beside him on the cross that fateful day. Dismas and his brother Jotham, along with Gestas, another young man who will share their fate, suffer tragedy and injustice at the hands of a band of thieves and a ruthless Roman centurion. Theirs is a story of survival against the odds, but they cannot outrun their destiny.','https://image.tmdb.org/t/p/w500/bkUxZ9sFE7tn0NPRILqZVEPZRF9.jpg','2021-02-25',6.2,0),(17254,'Tinker Bell and the Pirate Fairy','en','Zarina, a smart and ambitious dust-keeper fairy who’s captivated by Blue Pixie Dust and its endless possibilities, flees Pixie Hollow and joins forces with the scheming pirates of Skull Rock, who make her captain of their ship. Tinker Bell and her friends must embark on an epic adventure to find Zarina, and together they go sword-to-sword with the band of pirates led by a cabin boy named James, who’ll soon be known as Captain Hook himself.','https://image.tmdb.org/t/p/w500/qZLBe9Z8Y6WSDVqbqTQJUf8V1mp.jpg','2014-02-13',6.9,0),(17255,'Creed','en','The former World Heavyweight Champion Rocky Balboa serves as a trainer and mentor to Adonis Johnson, the son of his late friend and former rival Apollo Creed.','https://image.tmdb.org/t/p/w500/1BfTsk5VWuw8FCocAhCyqnRbEzq.jpg','2015-11-25',7.4,0),(17256,'Wrong Turn 3: Left for Dead','en','A group of people find themselves trapped in the backwoods of West Virginia, fighting for their lives against a group of vicious and horribly disfigured inbred cannibals.','https://image.tmdb.org/t/p/w500/84s4LMWuGbm4xPWW5PSbHyQhh33.jpg','2009-10-20',5.6,0),(17257,'Free Guy','en','A bank teller called Guy realizes he is a background character in an open world video game called Free City that will soon go offline.','https://image.tmdb.org/t/p/w500/xmbU4JTUm8rsdtn7Y3Fcm30GpeT.jpg','2021-08-13',7.6,0),(17258,'The Hunger Games: Mockingjay - Part 1','en','Katniss Everdeen reluctantly becomes the symbol of a mass rebellion against the autocratic Capitol.','https://image.tmdb.org/t/p/w500/4FAA18ZIja70d1Tu5hr5cj2q1sB.jpg','2014-11-19',6.8,0),(17259,'Good Will Hunting','en','Will Hunting has a genius-level IQ but chooses to work as a janitor at MIT. When he solves a difficult graduate-level math problem, his talents are discovered by Professor Gerald Lambeau, who decides to help the misguided youth reach his potential. When Will is arrested for attacking a police officer, Professor Lambeau makes a deal to get leniency for him if he will get treatment from therapist Sean Maguire.','https://image.tmdb.org/t/p/w500/bABCBKYBK7A5G1x0FzoeoNfuj2.jpg','1997-12-05',8.1,0),(17260,'The Lord of the Rings: The Return of the King','en','Aragorn is revealed as the heir to the ancient kings as he, Gandalf and the other members of the broken fellowship struggle to save Gondor from Sauron\'s forces. Meanwhile, Frodo and Sam take the ring closer to the heart of Mordor, the dark lord\'s realm.','https://image.tmdb.org/t/p/w500/rCzpDGLbOoPwLjy3OAm5NUPOTrC.jpg','2003-12-01',8.5,0),(17261,'Pirates of the Caribbean: Dead Man\'s Chest','en','Captain Jack Sparrow works his way out of a blood debt with the ghostly Davy Jones to avoid eternal damnation.','https://image.tmdb.org/t/p/w500/uXEqmloGyP7UXAiphJUu2v2pcuE.jpg','2006-07-06',7.3,0),(17262,'Wendell & Wild','en','Two demon brothers enlist the aid of Kat Elliot — a tough teen with a load of guilt — to summon them to the Land of the Living. But what Kat demands in return leads to a brilliantly bizarre and comedic adventure like no other.','https://image.tmdb.org/t/p/w500/5dsX6UAHqkQz1kiV8bs8SvjyVNa.jpg','2022-10-21',6.8,0),(17263,'Groot\'s First Steps','en','Following the events of “Guardians of the Galaxy Vol. 1,” Baby Groot is finally ready to try taking his first steps out of his pot—only to learn you have to walk before you can run.','https://image.tmdb.org/t/p/w500/1ifiV9ZJD4tC3tRYcnLIzH0meaB.jpg','2022-08-10',7.2,0),(17264,'The Last Warrior: Root of Evil','ru','Peace and tranquility have set in Belogorie. The evil was defeated and Ivan is now enjoying his well-deserved fame. He is surrounded by his family, friends and small wonders from the modern world that help him lead a comfortable life. Luckily, he has his Magic Sword to cut a gap between the worlds to get some supplies quite regularly. But when an ancient evil rises and the existence of the magic world is put to danger, Ivan has to team up with his old friends and his new rivals. They will set out on a long journey beyond the known world to find a way to defeat the enemies and to return peace to Belogorie.','https://image.tmdb.org/t/p/w500/5VJSIAhSn4qUsg5nOj4MhQhF5wQ.jpg','2021-01-01',7,0),(17265,'¡Asu Mare! The friends','es','Cachin\'s friends are back. After overcoming many adversities, an inheritance will put them to the test, facing funny situations and dark characters that will try to boycott one of their greatest dreams.','https://image.tmdb.org/t/p/w500/uMlbHCjeRggGcxTLswgc9svDlO3.jpg','2023-02-09',2,0),(17266,'Jungle Cruise','en','Dr. Lily Houghton enlists the aid of wisecracking skipper Frank Wolff to take her down the Amazon in his dilapidated boat. Together, they search for an ancient tree that holds the power to heal – a discovery that will change the future of medicine.','https://image.tmdb.org/t/p/w500/9dKCd55IuTT5QRs989m9Qlb7d2B.jpg','2021-07-28',7.5,0),(17267,'Up','en','Carl Fredricksen spent his entire life dreaming of exploring the globe and experiencing life to its fullest. But at age 78, life seems to have passed him by, until a twist of fate (and a persistent 8-year old Wilderness Explorer named Russell) gives him a new lease on life.','https://image.tmdb.org/t/p/w500/vpbaStTMt8qqXaEgnOR2EE4DNJk.jpg','2009-05-28',7.9,0),(17268,'Thor: Ragnarok','en','Thor is imprisoned on the other side of the universe and finds himself in a race against time to get back to Asgard to stop Ragnarok, the destruction of his home-world and the end of Asgardian civilization, at the hands of a powerful new threat, the ruthless Hela.','https://image.tmdb.org/t/p/w500/rzRwTcFvttcN1ZpX2xv4j3tSdJu.jpg','2017-10-24',7.6,0),(17269,'Kung Fu Panda','en','When the Valley of Peace is threatened, lazy Po the panda discovers his destiny as the \"chosen one\" and trains to become a kung fu hero, but transforming the unsleek slacker into a brave warrior won\'t be easy. It\'s up to Master Shifu and the Furious Five -- Tigress, Crane, Mantis, Viper and Monkey -- to give it a try.','https://image.tmdb.org/t/p/w500/xCn3VOST64XpOA8x0gaQkQiZtZY.jpg','2008-06-04',7.2,0),(17270,'Terminator Genisys','en','The year is 2029. John Connor, leader of the resistance continues the war against the machines. At the Los Angeles offensive, John\'s fears of the unknown future begin to emerge when TECOM spies reveal a new plot by SkyNet that will attack him from both fronts; past and future, and will ultimately change warfare forever.','https://image.tmdb.org/t/p/w500/oZRVDpNtmHk8M1VYy1aeOWUXgbC.jpg','2015-06-23',5.9,0),(17271,'It Chapter Two','en','27 years after overcoming the malevolent supernatural entity Pennywise, the former members of the Losers\' Club, who have grown up and moved away from Derry, are brought back together by a devastating phone call.','https://image.tmdb.org/t/p/w500/zfE0R94v1E8cuKAerbskfD3VfUt.jpg','2019-09-04',6.9,0),(17272,'Don\'t Worry Darling','en','Alice and Jack are lucky to be living in the idealized community of Victory, the experimental company town housing the men who work for the top-secret Victory Project and their families. But when cracks in their idyllic life begin to appear, exposing flashes of something much more sinister lurking beneath the attractive façade, Alice can’t help questioning exactly what they’re doing in Victory, and why.','https://image.tmdb.org/t/p/w500/jOqxKIOC92BVyinYO1Fm73XY7Tc.jpg','2022-09-21',6.9,0),(17273,'Kangaroo Valley','en','Journey to a secret valley in Australia, where a nervous baby kangaroo named Mala faces hungry dingoes and winter snows in this coming-of-age adventure.','https://image.tmdb.org/t/p/w500/q8T4Zp0b9hSSJkuavEYGF2h7omf.jpg','2022-12-14',6.2,0),(17274,'I Am Number Four','en','A teenage fugitive with an incredible secret races to stay one step ahead of the mysterious forces seeking destroy him in this sci-fi action thriller. With three dead and one on the run, the race to find the elusive Number Four begins. Outwardly normal teen John Smith never gets too comfortable in the same identity, and along with his guardian, Henri, he is constantly moving from town to town. With each passing day, John gains a stronger grasp on his extraordinary new powers, and his bond to the beings that share his fantastic fate grows stronger.','https://image.tmdb.org/t/p/w500/973sCL0OjAk2Igq46SDwhyDFv3n.jpg','2011-02-18',6.2,0),(17275,'The Visitor','en','After a series of tragedies including the death of his father-in-law, Robert and his wife Maia leave their home in London to move back to her childhood home. But when Robert discovers an old portrait in the attic of a man who is his spitting image, he goes down a rabbit hole to discover the identity of this mysterious doppelganger known only as the visitor. It isn’t long until he realizes – where the visitor goes, death follows.','https://image.tmdb.org/t/p/w500/1FchVTEnjQw6m5NnQBa8QwjUv6T.jpg','2022-10-07',5.9,0),(17276,'Bromates','en','Longtime best friends Sid and Jonesie are dumped by their respective girlfriends. Both without a living situation, they decide to become \"bromates\", bros who are roommates, which puts their relationship to the ultimate test.','https://image.tmdb.org/t/p/w500/hAaJ1XFp5FELxwJ98IWI598zaMy.jpg','2022-10-07',5.3,0),(17277,'Cinderella','en','Cinderella has faith her dreams of a better life will come true. With help from her loyal mice friends and a wave of her Fairy Godmother\'s wand, Cinderella\'s rags are magically turned into a glorious gown and off she goes to the Royal Ball. But when the clock strikes midnight, the spell is broken, leaving a single glass slipper... the only key to the ultimate fairy-tale ending!','https://image.tmdb.org/t/p/w500/avz6S9HYWs4O8Oe4PenBFNX4uDi.jpg','1950-02-22',7,0),(17278,'Captain America: Civil War','en','Following the events of Age of Ultron, the collective governments of the world pass an act designed to regulate all superhuman activity. This polarizes opinion amongst the Avengers, causing two factions to side with Iron Man or Captain America, which causes an epic battle between former allies.','https://image.tmdb.org/t/p/w500/rAGiXaUfPzY7CDEyNKUofk3Kw2e.jpg','2016-04-27',7.4,0),(17279,'7 Women and a Murder','it','When their family patriarch is stabbed, seven women, each with ulterior motives, become trapped together in a mansion to solve the puzzle of his murder. This is the  Italian remake of François Ozon\'s 8 Women.','https://image.tmdb.org/t/p/w500/iz2tpJJgSDBS646VYhmNkUmot4l.jpg','2021-12-25',5.6,0),(17280,'Just Love and a Thousand Songs','es','On the 10th anniversary of Violetta’s release, Tini gets together with her former castmates to celebrate, giving her fans an intimate, unique, and unforgettable show. Tini, Jorge Blanco, Candelaria Molfese, and Mercedes Lambre gave the audience a night to remember with their new versions of five of the show’s songs.','https://image.tmdb.org/t/p/w500/4BnFvDXO7UVXhxTCUvhf7R3UirK.jpg','2022-12-08',7.1,0),(17281,'Psychosexual','es','After finding her boyfriend cheating on her, a woman becomes obsessed with a YouTuber to the point that she thinks he\'s the perfect man for her.','https://image.tmdb.org/t/p/w500/g5cEKhHn2NSH18FxASF8UT0LfsC.jpg','2022-05-12',2,0),(17282,'Chernobyl: Abyss','ru','The aftermath of a shocking explosion at the Chernobyl nuclear power station made hundreds of people sacrifice their lives to clean up the site of the catastrophe and to successfully prevent an even bigger disaster that could have turned a large part of the European continent into an uninhabitable exclusion zone. This is their story.','https://image.tmdb.org/t/p/w500/AmJLuHjxPdIJO6vmymeWADG6jK5.jpg','2021-04-15',6.2,0),(17283,'The Man from Toronto','en','In a case of mistaken identity, the world’s deadliest assassin, known as the Man from Toronto, and a New York City screw-up are forced to team up after being confused for each other at a rental cabin.','https://image.tmdb.org/t/p/w500/uTCfTibqtk4f90cC59bLPMOmsfc.jpg','2022-12-23',6.9,0),(17284,'Black Site','en','A group of officers based in a labyrinthine top-secret prison must fight for their lives against Hatchet, a brilliant and infamous high-value detainee. When he escapes, his mysterious and deadly agenda has far reaching and dire consequences.','https://image.tmdb.org/t/p/w500/ipn8khVVC4eToWiGf89WF9J5PJn.jpg','2022-05-05',6.8,0),(17285,'Blacklight','en','Travis Block is a shadowy Government agent who specializes in removing operatives whose covers have been exposed. He then has to uncover a deadly conspiracy within his own ranks that reaches the highest echelons of power.','https://image.tmdb.org/t/p/w500/8jIyu2UfEsCYlxg2vFUaHeALeoD.jpg','2022-02-10',6.3,0),(17286,'Inception','en','Cobb, a skilled thief who commits corporate espionage by infiltrating the subconscious of his targets is offered a chance to regain his old life as payment for a task considered to be impossible: \"inception\", the implantation of another person\'s idea into a target\'s subconscious.','https://image.tmdb.org/t/p/w500/edv5CZvWj09upOsy2Y6IwDhK8bt.jpg','2010-07-15',8.4,0),(17287,'Barbie: Mermaid Power','en','Join Barbie “Brooklyn” Roberts, Barbie “Malibu” Roberts, and her sisters Skipper, Stacie, and Chelsea on an underwater adventure as they transform into mermaids to help save the world of Pacifica! In Barbie Mermaid Power™, Barbie and Barbie are summoned by Isla (from Dolphin Magic) to compete to be the underwater Power Keeper in a series of challenges designed to find their inner powers. Through these competitions, they discover whether they are mermaids of Earth, Air, Water, or Fire, all while making new animal and mermaid friends. In this fish-tale of friendship, adventure, and bravery, Barbie, Barbie, and family experience first-hand what it’s like to balance the worlds above and below the sea and learn a lesson in finding their inner powers along the way.','https://image.tmdb.org/t/p/w500/8qb8cLDBAWdahrtixN2mQdI6e52.jpg','2022-10-14',7.4,0),(17288,'Perfect Addiction','en','When successful boxing trainer Sienna Lane discovers that her boyfriend Jax, the reigning champion, has been cheating on her with her own sister, she sets out to get revenge by training the one man capable of dethroning him: his arch-nemesis Kayden.','https://image.tmdb.org/t/p/w500/r2JAzPxScAAHmfGvUVJQuEemUvL.jpg','2023-02-16',0,0),(17289,'The Last of Us: One Night Live','en','To celebrate the launch of the PS4 version of The Last of Us, Naughty Dog brings last year’s Game of the Year to life in front of hundreds of fans in Santa Monica. This special one night only event will celebrate the artistry behind the game with a performance of the score, plus a “live read” of key scenes featuring the principal actors, as directed by Neil Druckmann','https://image.tmdb.org/t/p/w500/biqPsH5ynY8uC0GP4mH0dAliVKN.jpg','2014-07-28',7.5,0),(17290,'Inside Out','en','Growing up can be a bumpy road, and it\'s no exception for Riley, who is uprooted from her Midwest life when her father starts a new job in San Francisco. Riley\'s guiding emotions— Joy, Fear, Anger, Disgust and Sadness—live in Headquarters, the control centre inside Riley\'s mind, where they help advise her through everyday life and tries to keep things positive, but the emotions conflict on how best to navigate a new city, house and school.','https://image.tmdb.org/t/p/w500/2H1TmgdfNtsKlU9jKdeNyYL5y8T.jpg','2015-06-09',7.9,0),(17291,'The Lord of the Rings: The Two Towers','en','Frodo and Sam are trekking to Mordor to destroy the One Ring of Power while Gimli, Legolas and Aragorn search for the orc-captured Merry and Pippin. All along, nefarious wizard Saruman awaits the Fellowship members at the Orthanc Tower in Isengard.','https://image.tmdb.org/t/p/w500/5VTN0pR8gcqV3EPUHHfMGnJYN9L.jpg','2002-12-18',8.4,0),(17292,'Jurassic World: Fallen Kingdom','en','When the island\'s dormant volcano begins roaring to life, Owen and Claire mount a campaign to rescue the remaining dinosaurs from this extinction-level event.','https://image.tmdb.org/t/p/w500/x8cLgs0uXlb9rmpuVIxopoRGnCr.jpg','2018-06-22',6.6,0),(17293,'San Andreas','en','In the aftermath of a massive earthquake in California, a rescue-chopper pilot makes a dangerous journey across the state in order to rescue his estranged daughter.','https://image.tmdb.org/t/p/w500/2Gfjn962aaFSD6eST6QU3oLDZTo.jpg','2015-05-27',6.2,0),(17294,'Blade Runner 2049','en','Thirty years after the events of the first film, a new blade runner, LAPD Officer K, unearths a long-buried secret that has the potential to plunge what\'s left 