urprisingly, neither wants to see the other ever again. However, fate intervenes when both Jim and Lauren, unbeknown to each other, purchase one-half of the same vacation package at a South African resort for families. They and their children are forced to share the same suite and participate in a slew of family activities together, where their attractions grows as their respective kids benefit from the burgeoning relationship.','https://image.tmdb.org/t/p/w500/jvGN091oLHWXptuHEZab7Kj4ZFe.jpg','2014-05-21',6.9,0),(17481,'Private Lesson','tr','Posing as a private tutor, Azra secretly coaches students on achieving their goals in life and love — but not without a few bumps in the road.','https://image.tmdb.org/t/p/w500/opZP5nuSvgB06NL0Nt2gsQbq3vS.jpg','2022-12-16',7,0),(17482,'Chip \'n Dale: Rescue Rangers','en','Decades since their successful television series was canceled, Chip has succumbed to a life of suburban domesticity as an insurance salesman. Dale, meanwhile, has had CGI surgery and works the nostalgia convention circuit, desperate to relive his glory days. When a former cast mate mysteriously disappears, Chip and Dale must repair their broken friendship and take on their Rescue Rangers detective personas once again to save their friend’s life.','https://image.tmdb.org/t/p/w500/7UGmn8TyWPPzkjhLUW58cOUHjPS.jpg','2022-05-20',7,0),(17483,'Cosas de amigos','es','When a man tells his friends that he is gay and asks for the appropriate emotional support, one of them, the most conservative, decides to try to reverse the situation. From there, a series of comic situations are unleashed that will take the group through different emotional stages that will help them reinvent friendship.','https://image.tmdb.org/t/p/w500/AaHk1y7W7qK8I0cmjzPM9sydVHD.jpg','2022-04-28',6,0),(17484,'The Kids Are Alright 2','es','A year ago Ricardo and Felipe, in charge of taking the children to a camp, stayed outside the train leaving the children inside. Clara no longer trusts them and this year she decides to take the children personally with the help of her friend Susana. However, now they will be the ones who, as a result of an accident, are separated from the children.','https://image.tmdb.org/t/p/w500/cIiADRt9KGEqYy1293BBBm2IQG.jpg','2022-12-02',7.7,0),(17485,'The Passion of the Christ','en','A graphic portrayal of the last twelve hours of Jesus of Nazareth\'s life.','https://image.tmdb.org/t/p/w500/2C9vyK6leWDb2ds65R7uIwSmh8V.jpg','2004-02-25',7.4,0),(17486,'Shazam!','en','A boy is given the ability to become an adult superhero in times of need with a single magic word.','https://image.tmdb.org/t/p/w500/xnopI5Xtky18MPhK40cZAGAOVeV.jpg','2019-03-29',7,0),(17487,'Virgin Forest','tl','A photographer is tasked to take a photo of a rare flower thriving in the mountain, but he discovers women trapped in a hidden brothel for illegal loggers.','https://image.tmdb.org/t/p/w500/6JsAHnDolJDCid4vCUO0JsSy997.jpg','2022-06-24',5.5,0),(17488,'Scary Movie 5','en','Home with their newly-formed family, happy parents Dan and Jody are haunted by sinister, paranormal activities. Determined to expel the insidious force, they install security cameras and discover their family is being stalked by an evil dead demon.','https://image.tmdb.org/t/p/w500/r2Jwo4Eoax0oOnsU5qcXv0ea0Q8.jpg','2013-04-11',4.8,0),(17489,'Collision','en','Over the course of one fateful day, a corrupt businessman and his socialite wife race to save their daughter from a notorious crime lord.','https://image.tmdb.org/t/p/w500/4R04UI3ThgIIaZjQNIVk9WmI8MC.jpg','2022-06-16',6,0),(17490,'Mummies','es','Through a series of unfortunate events, three mummies end up in present-day London and embark on a wacky and hilarious journey in search of an old ring belonging to the Royal Family, that was stolen by the ambitious archaeologist Lord Carnaby.','https://image.tmdb.org/t/p/w500/8j5fKrsCslelwMobhA9kbROeijA.jpg','2023-01-05',4.8,0),(17491,'Taken','en','While vacationing with a friend in Paris, an American girl is kidnapped by a gang of human traffickers intent on selling her into forced prostitution. Working against the clock, her ex-spy father must pull out all the stops to save her. But with his best years possibly behind him, the job may be more than he can handle.','https://image.tmdb.org/t/p/w500/lH9FUehHKC5SqZJ0N2e6CNapzt2.jpg','2008-02-18',7.4,0),(17492,'The Jungle Book','en','The boy Mowgli makes his way to the man-village with Bagheera, the wise panther. Along the way he meets jazzy King Louie, the hypnotic snake Kaa and the lovable, happy-go-lucky bear Baloo, who teaches Mowgli \"The Bare Necessities\" of life and the true meaning of friendship.','https://image.tmdb.org/t/p/w500/yN1kuupnPTLUprgfvC5WapgrxG4.jpg','1967-10-18',7.3,0),(17493,'The Mummy','en','Dashing legionnaire Rick O\'Connell stumbles upon the hidden ruins of Hamunaptra while in the midst of a battle to claim the area in 1920s Egypt. It has been over three thousand years since former High Priest Imhotep suffered a fate worse than death as a punishment for a forbidden love—along with a curse that guarantees eternal doom upon the world if he is ever awoken.','https://image.tmdb.org/t/p/w500/yhIsVvcUm7QxzLfT6HW2wLf5ajY.jpg','1999-04-16',6.9,0),(17494,'xXx: Return of Xander Cage','en','Extreme athlete turned government operative Xander Cage comes out of self-imposed exile, thought to be long dead, and is set on a collision course with deadly alpha warrior Xiang and his team in a race to recover a sinister and seemingly unstoppable weapon known as Pandora\'s Box. Recruiting an all-new group of thrill-seeking cohorts, Xander finds himself enmeshed in a deadly conspiracy that points to collusion at the highest levels of world governments.','https://image.tmdb.org/t/p/w500/hba8zREJpP1AYhaXgb2oJLQeO0K.jpg','2017-01-13',6.1,0),(17495,'How to Train Your Dragon','en','As the son of a Viking leader on the cusp of manhood, shy Hiccup Horrendous Haddock III faces a rite of passage: he must kill a dragon to prove his warrior mettle. But after downing a feared dragon, he realizes that he no longer wants to destroy it, and instead befriends the beast – which he names Toothless – much to the chagrin of his warrior father.','https://image.tmdb.org/t/p/w500/ygGmAO60t8GyqUo9xYeYxSZAR3b.jpg','2010-03-18',7.8,0),(17496,'Fantastic Four','en','Four young outsiders teleport to a dangerous universe, which alters their physical form in shocking ways. Their lives irrevocably upended, the team must learn to harness their daunting new abilities and work together to save Earth from a former friend turned enemy.','https://image.tmdb.org/t/p/w500/oeMpEsjmiT9PEJbRM1Fm7TZ1dE0.jpg','2015-08-05',4.4,0),(17497,'Justice League','en','Fuelled by his restored faith in humanity and inspired by Superman\'s selfless act, Bruce Wayne and Diana Prince assemble a team of metahumans consisting of Barry Allen, Arthur Curry and Victor Stone to face the catastrophic threat of Steppenwolf and the Parademons who are on the hunt for three Mother Boxes on Earth.','https://image.tmdb.org/t/p/w500/eifGNCSDuxJeS1loAXil5bIGgvC.jpg','2017-11-15',6.1,0),(17498,'Catch Me If You Can','en','A true story about Frank Abagnale Jr. who, before his 19th birthday, successfully conned millions of dollars worth of checks as a Pan Am pilot, doctor, and legal prosecutor. An FBI agent makes it his mission to put him behind bars. But Frank not only eludes capture, he revels in the pursuit.','https://image.tmdb.org/t/p/w500/sdYgEkKCDPWNU6KnoL4qd8xZ4w7.jpg','2002-12-16',8,0),(17499,'End of the Road','en','Recently widowed mom Brenda fights to protect her family during a harrowing road trip when a murder and a missing bag of cash plunge them into danger.','https://image.tmdb.org/t/p/w500/2mxnDbKCoR1M9e5szzc6Ku3Nfmv.jpg','2022-09-09',6.2,0),(17500,'Cinderella','en','When her father unexpectedly passes away, young Ella finds herself at the mercy of her cruel stepmother and her daughters. Never one to give up hope, Ella\'s fortunes begin