 heir. After the marriage, Raj gets bored of Tara and starts seeking another female to satisfy his sexual needs. He notices Maya and is instantly attracted to her. He has her included as one of his courtesans, and is intimate with her. Watch what happens when Tara finds out and the extent she will go to keep her marriage intact.','https://image.tmdb.org/t/p/w500/dwbLcEPIjVISly6DW8GLX8vsZlE.jpg','1996-09-11',5.7,0),(17514,'Ice Age: Continental Drift','en','Manny, Diego, and Sid embark upon another adventure after their continent is set adrift. Using an iceberg as a ship, they encounter sea creatures and battle pirates as they explore a new world.','https://image.tmdb.org/t/p/w500/veS3B9N5Kn2Zv8W5KemjhyPjNsd.jpg','2012-06-27',6.4,0),(17515,'Scary Movie 2','en','While the original parodied slasher flicks like Scream, Keenen Ivory Wayans\'s sequel to Scary Movie takes comedic aim at haunted house movies. A group of students visit a mansion called \"Hell House,\" and murderous high jinks ensue.','https://image.tmdb.org/t/p/w500/7Eb1JWK0Cb0rbfsYjwfc9g0PbQH.jpg','2001-07-04',5.8,0),(17516,'Forrest Gump','en','A man with a low IQ has accomplished great things in his life and been present during significant historic events—in each case, far exceeding what anyone imagined he could do. But despite all he has achieved, his one true love eludes him.','https://image.tmdb.org/t/p/w500/arw2vcBveWOVZr6pxd9XTd1TdQa.jpg','1994-06-23',8.5,0),(17517,'Man of Steel','en','A young boy learns that he has extraordinary powers and is not of this earth. As a young man, he journeys to discover where he came from and what he was sent here to do. But the hero in him must emerge if he is to save the world from annihilation and become the symbol of hope for all mankind.','https://image.tmdb.org/t/p/w500/1qsVZo2StiftOGsnVO9VsV1d5lz.jpg','2013-06-12',6.6,0),(17518,'Maleficent: Mistress of Evil','en','Maleficent and her goddaughter Aurora begin to question the complex family ties that bind them as the