06-14',6.1,0),(17538,'Crank: High Voltage','en','Chelios faces a Chinese mobster who has stolen his nearly indestructible heart and replaced it with a battery-powered ticker that requires regular jolts of electricity to keep working.','https://image.tmdb.org/t/p/w500/tzTC4EEvF0OPL63frEiogxL2T8M.jpg','2009-04-16',6,0),(17539,'Beneath the Surface','en','A young woman survives a great white shark attack, whilst on a family boating vacation, however soon realizes the nightmare is far from over. Those around her can not be trusted, and she must face her demons, if she is to step back in the water.','https://image.tmdb.org/t/p/w500/xXE9IDEFiye0zNzmnT0eUDbGyVI.jpg','2022-04-01',6.8,0),(17540,'Selena Gomez: My Mind & Me','en','After years in the limelight, Selena Gomez achieves unimaginable stardom. But just as she reaches a new peak, an unexpected turn pulls her into darkness. This uniquely raw and intimate documentary spans her six-year journey into a new light.','https://image.tmdb.org/t/p/w500/oMpsswJv8x4vnOnIKqs4xJs2Kn3.jpg','2022-11-04',8.3,0),(17541,'Puss in Book: Trapped in an Epic Tale','en','After tumbling into a magic storybook, Puss in Boots must fight, dance and romance his way through wild adventures as he searches for an escape.','https://image.tmdb.org/t/p/w500/7oaCHEtTsPaFtL9rvlRbbiiz1bP.jpg','2017-06-16',6.7,0),(17542,'Catch the Fair One','en','A Native American boxer embarks on the fight of her life when she goes in search of her missing sister.','https://image.tmdb.org/t/p/w500/35QvPu5nOGlzDIGOdvtRNNkfjLZ.jpg','2022-02-11',6.5,0),(17543,'X-Men: Apocalypse','en','After the re-emergence of the world\'s first mutant, world-destroyer Apocalypse, the X-Men must unite to defeat his extinction level plan.','https://image.tmdb.org/t/p/w500/lRxsDK4exeEgKoXqI4zdr0Vl0yk.jpg','2016-05-18',6.5,0),(17544,'Spirit: Stallion of the Cimarron','en','As a wild stallion travels across the frontiers of the Old West, he befriends a young human and finds true love with a mare.'