hing is wrong. As night falls and the labour progresses, Lise begins to understand that a day that began in childhood might end with her becoming the woman of the house.','https://image.tmdb.org/t/p/w500/vbypiQf40ReopnfbW9eFKJmboA0.jpg','2021-09-19',5.9,0),(17587,'Logan','en','In the near future, a weary Logan cares for an ailing Professor X in a hideout on the Mexican border. But Logan\'s attempts to hide from the world and his legacy are upended when a young mutant arrives, pursued by dark forces.','https://image.tmdb.org/t/p/w500/fnbjcRDYn6YviCcePDnGdyAkYsB.jpg','2017-02-28',7.8,0),(17588,'Vendetta','en','When his daughter is murdered, William Duncan takes the law into his own hands, setting out on a quest for retribution. After killing the street thug responsible for her death, he finds himself in the middle of a war with the thug\'s brother, father, and their gang, who are equally hell-bent on getting even. What ensues is a tense back-and-forth game of vengeance. By the end, William comes to find that the quest for revenge never has a winner.','https://image.tmdb.org/t/p/w500/juah27ARLXRqbkgvlzilCs13s9S.jpg','2022-05-17',6.3,0),(17589,'An Argentinian Crime','es','Rosario in the 80s. The disappearance of a man during the military dictatorship. Two young people from the court must do everything possible to solve the case while facing police corruption and various dangers that put their lives at risk.','https://image.tmdb.org/t/p/w500/qdNog6ueztBWUAw8tsKlebmngRu.jpg','2022-08-25',6.3,0),(17590,'Dinosaur','en','An orphaned dinosaur raised by lemurs joins an arduous trek to a sancturary after a meteorite shower destroys his family home.','https://image.tmdb.org/t/p/w500/rSje3FS7ycJSglowlngjsvDt7vO.jpg','2000-05-19',6.5,0),(17591,'Alita: Battle Angel','en','When Alita awakens with no memory of who she is in a future world she does not recognize, she is taken in by Ido, a compassionate doctor who realizes that somewhere in this abandoned cyborg shell is the heart and 