kO.jpg','2022-01-07',5.8,0),(17621,'Frivolous Lola','it','The story takes place in northern Italy in the 1950\'s. Lola and Masetto are about to get married. Masetto wants to keep Lola as a virgin until they are married. But Lola is impatient to remain in chastity until the wedding night. She wants to be sure that Masetto is a good lover, before she commits herself into marriage. She does everything to trick Masetto into breaking the moral tradition.','https://image.tmdb.org/t/p/w500/lFG6NZNhJsF7Tb7vRhIp179h69G.jpg','1998-06-01',4.7,0),(17622,'Matando el tiempo','es','','https://image.tmdb.org/t/p/w500/iELu4oTlmDWktHcmysfVInbsrVC.jpg','2022-11-30',6,0),(17623,'Beauty and the Beast','en','A live-action adaptation of Disney\'s version of the classic tale of a cursed prince and a beautiful young woman who helps him break the spell.','https://image.tmdb.org/t/p/w500/hKegSKIDep2ewJWPUQD7u0KqFIp.jpg','2017-03-16',7,0),(17624,'Trolls World Tour','en','Queen Poppy and Branch make a surprising discovery — there are other Troll worlds beyond their own, and their distinct differences create big clashes between these various tribes. When a mysterious threat puts all of the Trolls across the land in danger, Poppy, Branch, and their band of friends must embark on an epic quest to create harmony among the feuding Trolls to unite them against certain doom.','https://image.tmdb.org/t/p/w500/7W0G3YECgDAfnuiHG91r8WqgIOe.jpg','2020-03-11',7.4,0),(17625,'The Greatest Beer Run Ever','en','Chickie wants to support his friends fighting in Vietnam, so he does something wild—personally bring them American beer. What starts as a well-meaning journey quickly changes Chickie’s life and perspective. Based on a true story.','https://image.tmdb.org/t/p/w500/ggf37TpcKaxwguhvtNn6MQpyqBn.jpg','2022-09-30',7.8,0),(17626,'Love & Other Drugs','en','Maggie is an alluring free spirit who won\'t let anyone – or anything – tie her down. But she meets her match in Jamie, whose relentless and nearly infallible charm serves him well with the ladies and the cutthroat world of pharmaceutical sales. Maggie and Jamie\'s evolving relationship takes them both by surprise, as they find themselves under the influence of the ultimate drug: love.','https://image.tmdb.org/t/p/w500/wZLM2uKJRYNchLmiCIjosX0rXy8.jpg','2010-11-22',7,0),(17627,'Abraham Lincoln: Vampire Hunter','en','President Lincoln\'s mother is killed by a supernatural creature, which fuels his passion to crush vampires and their slave-owning helpers.','https://image.tmdb.org/t/p/w500/5dTZylzoBV9qsrub9vYLAZrNkX3.jpg','2012-06-20',5.7,0),(17628,'The Monkey King: The Legend Begins','en','The Monkey King: The Legend Begins is the re-imagined version by Hollywood of the film The Monkey King: Havoc in Heavens Palace, the origin and birthplace of The Monkey King Story.','https://image.tmdb.org/t/p/w500/aYEWg7ir0XD4mMUA1pyHNGImrOZ.jpg','2022-11-02',6.8,0),(17629,'Where the Crawdads Sing','en','Abandoned by her family, Kya raises herself all alone in the marshes outside of her small town. When her former boyfriend is found dead, Kya is instantly branded by the local townspeople and law enforcement as the prime suspect for his murder.','https://image.tmdb.org/t/p/w500/kOTegoWSqQQPyR42Qb0v2G42bzQ.jpg','2022-07-15',7.6,0),(17630,'Hatching','fi','12 year old Tinja is desperate to please her mother, a woman obsessed with presenting the image of a perfect family. One night, Tinja finds a strange egg. What hatches is beyond belief.','https://image.tmdb.org/t/p/w500/jgJACjJIpcbFfEEmEglinfQWQPO.jpg','2022-03-04',6.4,0),(17631,'Alice in Wonderland','en','On a golden afternoon, young Alice follows a White Rabbit, who disappears down a nearby rabbit hole. Quickly following him, she tumbles into the burrow - and enters the merry, topsy-turvy world of Wonderland! Memorable songs and whimsical escapades highlight Alice\'s journey, which culminates in a madcap encounter with the Queen of Hearts - and her army of playing cards!','https://image.tmdb.org/t/p/w500/20cvfwfaFqNbe9Fc3VEHJuPRxmn.jpg','1951-07-28',7.2,0),(17632,'Fistful of Vengeance','en','A revenge mission becomes a fight to save the world from an ancient threat when superpowered assassin Kai tracks a killer to Bangkok.','https://image.tmdb.org/t/p/w500/3cccEF9QZgV9bLWyupJO41HSrOV.jpg','2022-02-17',5.6,0),(17633,'The Hunger Games: Mockingjay - Part 2','en','With the nation of Panem in a full scale war, Katniss confronts President Snow in the final showdown. Teamed with a group of her closest friends – including Gale, Finnick, and Peeta – Katniss goes off on a mission with the unit from District 13 as they risk their lives to stage an assassination attempt on President Snow who has become increasingly obsessed with destroying her. The mortal traps, enemies, and moral choices that await Katniss will challenge her more than any arena she faced in The Hunger Games.','https://image.tmdb.org/t/p/w500/lImKHDfExAulp16grYm8zD5eONE.jpg','2015-11-18',6.9,0),(17634,'Grounded: Making The Last of Us','en','A feature-length exploration of the game\'s creation, GROUNDED: Making the Last of Us is a love letter to the trials of exploring new territory. There are no road maps or guide books for creating a new world. The only way through is to fail—over and over again. This is the story of how a team of artists, musicians, programmers, writers, actors, filmmakers, playtesters, and a lonely UI designer—came together and pushed each other to build something larger than themselves.','https://image.tmdb.org/t/p/w500/dhfM8t16UlDwljSkKlYVGkL92Mf.jpg','2013-06-14',7.4,0),(17635,'Shutter Island','en','World War II soldier-turned-U.S. Marshal Teddy Daniels investigates the disappearance of a patient from a hospital for the criminally insane, but his efforts are compromised by troubling visions and a mysterious doctor.','https://image.tmdb.org/t/p/w500/kve20tXwUZpu4GUX8l6X7Z4jmL6.jpg','2010-02-14',8.2,0),(17636,'Pirates of the Caribbean: Dead Men Tell No Tales','en','Thrust 