ow Super Heroes from the Phantom Zone, but a fortuitous wrong turn leads them to Titans Tower – where they find much-needed allies in the Teen Titans!','https://image.tmdb.org/t/p/w500/3Hnhf1FqVGnh20hKlHbiRvHhB5b.jpg','2022-05-23',6.9,0),(17646,'Overcomer','en','After reluctantly agreeing to coach cross-country, high school basketball Coach John Harrison helps the least likely runner attempt the impossible in the biggest race of the year.','https://image.tmdb.org/t/p/w500/rVR3uN1yPRqYBBtNFSrEKCpRhaK.jpg','2019-08-22',7.7,0),(17647,'Mission: Impossible - Fallout','en','When an IMF mission ends badly, the world is faced with dire consequences. As Ethan Hunt takes it upon himself to fulfill his original briefing, the CIA begin to question his loyalty and his motives. The IMF team find themselves in a race against time, hunted by assassins while trying to prevent a global catastrophe.','https://image.tmdb.org/t/p/w500/AkJQpZp9WoNdj7pLYSj1L0RcMMN.jpg','2018-07-13',7.4,0),(17648,'The Host','en','A parasitic alien soul is injected into the body of Melanie Stryder. Instead of carrying out her race\'s mission of taking over the Earth, \"Wanda\" (as she comes to be called) forms a bond with her host and sets out to aid other free humans.','https://image.tmdb.org/t/p/w500/ok2sl6rGITZ0W94DeRU4VkB2ssW.jpg','2013-03-22',6.3,0),(17649,'Summit Fever','en','A daring dream to scale the world\'s most challenging trio of mountains soon turns into a terrifying nightmare for a group of friends when a deadly storm traps the climbers near the summit and cuts off all hope of rescue. With the odds stacked against them, the friends are forced to trust each other to save themselves by any means necessary.','https://image.tmdb.org/t/p/w500/rX9k5v7JYmnaBO5E89PZ4yMfuvo.jpg','2022-10-13',5.6,0),(17650,'The Boy, the Mole, the Fox and the Horse','en','The unlikely friendship of a boy, a mole, a fox and a horse traveling together in the boy’s search for home.','https://image.tmdb.org/t/p/w500/oQRgyQC