,'The Dwarves, Bilbo and Gandalf have successfully escaped the Misty Mountains, and Bilbo has gained the One Ring. They all continue their journey to get their gold back from the Dragon, Smaug.','https://image.tmdb.org/t/p/w500/xQYiXsheRCDBA39DOrmaw1aSpbk.jpg','2013-12-11',7.6,0),(17660,'Host','en','Six friends hire a medium to hold a séance via Zoom during lockdown — but they get far more than they bargained for as things quickly go wrong. When an evil spirit starts invading their homes, they begin to realize they might not survive the night.','https://image.tmdb.org/t/p/w500/h7dZpJDORYs5c56dydbrLFkEXpE.jpg','2020-12-04',6.5,0),(17661,'Heatwave','en','A woman\'s life takes an unexpected turn when she falls for her boss\'s wife. She must soon defend herself as she becomes entangled in a web of malice.','https://image.tmdb.org/t/p/w500/kd2kN3tnsDNgPDf3lKhgn1aKtfy.jpg','2022-01-17',6.9,0),(17662,'Dawn of the Planet of the Apes','en','A group of scientists in San Francisco struggle to stay alive in the aftermath of a plague that is wiping out humanity, while Caesar tries to maintain dominance over his community of intelligent apes.','https://image.tmdb.org/t/p/w500/kScdQEwS9jPEdnO23XjGAtaoRcT.jpg','2014-06-26',7.3,0),(17663,'Vanguard','zh','Covert security company Vanguard is the last hope of survival for an accountant after he is targeted by the world\'s deadliest mercenary organization.','https://image.tmdb.org/t/p/w500/mKvw1Ic9enfFlCPBNJGiejRPMUO.jpg','2020-09-30',6.4,0),(17664,'Indemnity','en','An ex-fireman with PTSD goes on the run when accused of a crime he doesn\'t even remember committing, leading him down a rabbit hole of conspiracy to the highest degree.','https://image.tmdb.org/t/p/w500/8y1rfKHot8DF0cQhGvKXtYsMjNx.jpg','2022-02-11',7,0),(17665,'Collide','en','A gripping thriller chronicling three couples over the course of one fateful night in an LA restaurant. Hunter finds himself on an awkward blind date with the captivating Tamira, while a busboy and his girlfriend are hiding mounds of cocaine to score a big payday, and outside, Peter sits in his car observing his wife’s infidelity with the restaurant’s manager. Though all strangers, their stories are weaved together as they hurl towards an explosive end.','https://image.tmdb.org/t/p/w500/c2aNdB6vCkwMpwDJO81mntGh0WS.jpg','2022-08-05',4.7,0),(17666,'Eternal Sunshine of the Spotless Mind','en','Joel Barish, heartbroken that his girlfriend underwent a procedure to erase him from her memory, decides to do the same. However, as he watches his memories of her fade away, he realises that he still loves her, and may be too late to correct his mistake.','https://image.tmdb.org/t/p/w500/5MwkWH9tYHv3mV9OdYTMR5qreIz.jpg','2004-03-19',8.1,0),(17667,'Aladdin','en','A kindhearted street urchin named Aladdin embarks on a magical adventure after finding a lamp that releases a wisecracking genie while a power-hungry Grand Vizier vies for the same lamp that has the power to make their deepest wishes come true.','https://image.tmdb.org/t/p/w500/ykUEbfpkf8d0w49pHh0AD2KrT52.jpg','2019-05-22',7.1,0),(17668,'Three Christs','en','Dr. Alan Stone breaks new ground for treatment of the mentally ill through an experiment on three paranoid schizophrenic patients who believe they are Jesus Christ.','https://image.tmdb.org/t/p/w500/4FuSQ9klymXIppnfNUTBg9rOEPf.jpg','2017-09-23',6.9,0),(17669,'Bambi','en','Bambi\'s tale unfolds from season to season as the young prince of the forest learns about life, love, and friends.','https://image.tmdb.org/t/p/w500/wV9e2y4myJ4KMFsyFfWYcUOawyK.jpg','1942-02-11',7,0),(17670,'Rise of the Teenage Mutant Ninja Turtles: The Movie','en','When a mysterious stranger arrives from the future with a dire warning, Leo is forced to rise and lead his brothers, Raph, Donnie, and Mikey in a fight to save the world from a terrifying alien species.','https://image.tmdb.org/t/p/w500/rSmTqtb7gICeRwvsEmq0uJxR4XU.jpg','2022-08-05',7.5,0),(17671,'Suicide Squad','en','From DC Comics comes the Suicide Squad, an antihero team of incarcerated supervillains who act as deniable assets for the United States government, undertaking high-risk black ops missions in exchange for commuted prison sentences.','https://image.tmdb.org/t/p/w500/xFw9RXKZDvevAGocgBK0zteto4U.jpg','2016-08-03',5.9,0),(17672,'22 Jump Street','en','After making their way through high school (twice), big changes are in store for officers Schmidt and Jenko when they go deep undercover at a local college. But when Jenko meets a kindred spirit on the football team, and Schmidt infiltrates the bohemian art major scene, they begin to question their partnership. Now they don\'t have to just crack the case - they have to figure out if they can have a mature relationship. If these two overgrown adolescents can grow from freshmen into real men, college might be the best thing that ever happened to them.','https://image.tmdb.org/t/p/w500/850chzYHYbT3IISl6Q7dbBuFP2B.jpg','2014-06-05',6.8,0),(17673,'Matilda','en','An extraordinarily intelligent young girl from a cruel and uncaring family discovers she possesses telekinetic powers and is sent off to a school headed by a tyrannical principal.','https://image.tmdb.org/t/p/w500/wnLbqoGRGdnPNjMV6rY75wgRamd.jpg','1996-08-02',7.1,0),(17674,'The Hunger Games: Catching Fire','en','Katniss Everdeen has returned home safe after winning the 74th Annual Hunger Games along with fellow tribute Peeta Mellark. Winning means that they must turn around and leave their family and close friends, embarking on a \"Victor\'s Tour\" of the districts. Along the way Katniss senses that a rebellion is simmering, but the Capitol is still very much in control as President Snow prepares the 75th Annual Hunger Games (The Quarter Quell) - a competition that could change Panem forever.','https://image.tmdb.org/t/p/w500/6Szz3g7ngNsYU2oPqsZwMzqUnLC.jpg','2013-11-15',7.4,0),(17675,'Chickenhare and the Hamster of Darkness','en','Young Chickenhare is the adopted son of King Peter, a famous adventurer. Part chicken and part hare, he has a really tough time growing up and disguises himself as a hare to avoid the mockeries of his peers. When the day of the Royal Adventurer Society trials comes, Chickenhare, hampered by his disguise, fails miserably. But he is determined to grab a second chance and find the Scepter of the Hamster of Darkness, before his evil Uncle Lapin. The Scepter will give immense power to its holder. If Lapin gets hold of it, he will be unstoppable. Accompanied by his faithful servant Abe, a sarcastic turtle, and Meg, a martial arts expert skunk, he sets of on an epic and initiatory quest.','https://image.tmdb.org/t/p/w500/2v6f1EqTo4FUxVT9MDXpF6158AX.jpg','2022-02-16',7.5,0),(17676,'Terminator: Dark Fate','en','Decades after Sarah Connor prevented Judgment Day, a lethal new Terminator is sent to eliminate the future leader of the resistance. In a fight to save mankind, battle-hardened Sarah Connor teams up with an unexpected ally and an enhanced super soldier to stop the deadliest Terminator yet.','https://image.tmdb.org/t/p/w500/vqzNJRH4YyquRiWxCCOH0aXggHI.jpg','2019-10-23',6.5,0),(17677,'No Manches Frida','es','After his release from prison, bank robber Zequi sets off to recover the stolen money that was buried by his dizzy accomplice. He\'s horrified to learn that a high school gymnasium is now standing over the site where the loot is stashed. Needing to infiltrate the building, Zequi lands a job as a substitute teacher for a group of wild and unruly students. As the ex-con tries to lay down the law, he starts to realize that life in jail may have been easier than trying to deal with rebellious teens.','https://image.tmdb.org/t/p/w500/6HfyXfIEywLa2HvcswKi44dDKxL.jpg','2016-09-02',7.8,0),(17678,'Father There Is Only One 3','es','Christmas is coming. The children accidentally break a Nativity scene figurine from their father\'s collection and must by all means get an equal one, the problem is that it is a unique antique piece. 