tion staged by her two closest friends.','https://image.tmdb.org/t/p/w500/3QpO7dxLXBdPgWpNLKvRNojz7bv.jpg','2022-12-30',6.6,0),(17703,'Meet Joe Black','en','When the grim reaper comes to collect the soul of megamogul Bill Parrish, he arrives with a proposition: Host him for a \"vacation\" among the living in trade for a few more days of existence. Parrish agrees, and using the pseudonym Joe Black, Death begins taking part in Parrish\'s daily agenda and falls in love with the man\'s daughter. Yet when Black\'s holiday is over, so is Parrish\'s life.','https://image.tmdb.org/t/p/w500/fDPAjvfPMomkKF7cMRmL5Anak61.jpg','1998-11-12',7.3,0),(17704,'First Love','en','A young man’s difficult entry into adulthood, who experiences the highs and lows of his first love, while dealing with the familial fallout spurred by the financial crisis of 2008.','https://image.tmdb.org/t/p/w500/gwLNm5VYq68Q65100uOr5fyAh9A.jpg','2022-06-17',5.9,0),(17705,'The Water','es','It is summer in a small village in south-eastern Spain. A storm threatens to cause the river that runs through it to overflow again. A popular old belief claims that some women are predestined to disappear with each new flood, because they have the “water inside”. A band of young people is trying to overcome the weariness of a summer in the village that smells of death by smoking, dancing, and lusting after each other. In this electric atmosphere that precedes the storm, Ana and José live a love affair until the storm bursts.','https://image.tmdb.org/t/p/w500/ts3BNa663GZzGJNlYEr7GAbiUDh.jpg','2022-11-04',7.1,0),(17706,'Interceptor','en','A U.S. Army Captain uses her years of tactical training to save humanity from sixteen nuclear missiles launched at the U.S. as a violent attack threatens her remote missile interceptor station.','https://image.tmdb.org/t/p/w500/cpWUtkcgRKeauhTyVMjYHxAutp4.jpg','2022-05-26',6.2,0),(17707,'Battleship','en','When mankind beams a radio signal into space, a reply comes from ‘Planet G’, in the form of several alien crafts that splash down in the waters off Hawaii. Lieutenant Alex Hopper is a weapons officer assigned to the USS John Paul Jones, part of an international naval coalition which becomes the world\'s last hope for survival as they engage the hostile alien force of unimaginable strength. While taking on the invaders, Hopper must also try to live up to the potential that his brother, and his fiancée\'s father—an Admiral—expect of him.','https://image.tmdb.org/t/p/w500/iLV6PVkkutgeEH6O5XFo2L89u3K.jpg','2012-04-11',5.8,0),(17708,'Schindler\'s List','en','The true story of how businessman Oskar Schindler saved over a thousand Jewish lives from the Nazis while they worked as slaves in his factory during World War II.','https://image.tmdb.org/t/p/w500/sF1U4EUQS8YHUYjNl3pMGNIQyr0.jpg','1993-12-15',8.6,0),(17709,'Kingsman: The Golden Circle','en','When an attack on the Kingsman headquarters takes place and a new villain rises, Eggsy and Merlin are forced to work together with the American agency known as the Statesman to save the world.','https://image.tmdb.org/t/p/w500/34xBL6BXNYFqtHO9zhcgoakS4aP.jpg','2017-09-09',7,0),(17710,'Neige','fr','Several notables from the Chamonix region are found murdered in their homes. To move forward with investigation, police captain Thomas Delhaye decides to release Juliette Hémon from prison, imprisoned for a strangely similar case.','https://image.tmdb.org/t/p/w500/ild7w4syr1hAP0YyFmiJsEYKR7Z.jpg','2022-09-25',4,0),(17711,'Sicario','en','An idealistic FBI agent is enlisted by a government task force to aid in the escalating war against drugs at the border area between the U.S. and Mexico.','https://image.tmdb.org/t/p/w500/lz8vNyXeidqqOdJW9ZjnDAMb5Vr.jpg','2015-09-17',7.4,0),(17712,'Nightcrawler','en','When Lou Bloom, desperate for work, muscles into the world of L.A. crime journalism, he blurs the line between observer and participant to become the star of his own story. Aiding him in his effort is Nina, a TV-news veteran.','https://image.tmdb.org/t/p/w500/gYPIRu0jX2CGYdeO422cq3N78ju.jpg','2014-10-23',7.7,0),(17713,'The Good Nurse','en','Suspicious that her colleague is responsible for a series of mysterious patient deaths, a nurse risks her own life to uncover the truth.','https://image.tmdb.org/t/p/w500/rSq6cq0LCcbro10jbEaPTEb3WmW.jpg','2022-10-19',7,0),(17714,'Descendants: The Royal Wedding','en','Happily-ever-after continues for Auradon\'s power couple as they prepare to say \"I do\" at an epic celebration with their friends and family, but Hades threatens to ruin it all.','https://image.tmdb.org/t/p/w500/tK5xU4x7w9npLUYT5xZJ4RvVlsM.jpg','2021-08-13',6.9,0),(17715,'Annabelle: Creation','en','Several years after the tragic death of their little girl, a doll maker and his wife welcome a nun and several girls from a shuttered orphanage into their home, soon becoming the target of the doll maker\'s possessed creation—Annabelle.','https://image.tmdb.org/t/p/w500/tb86j8jVCVsdZnzf8I6cIi65IeM.jpg','2017-08-03',6.6,0),(17716,'Valley of the Dead','es','During the Spanish Civil War, sworn enemies must work together when they encounter flesh-eating zombies created in a Nazi experiment.','https://image.tmdb.org/t/p/w500/avokvOwhjVR9GgISsSSgb2A343G.jpg','2020-10-08',6.3,0),(17717,'Barbie as The Princess & the Pauper','en','Princess Anneliese finds an unexpected friendship when she meets her humble look-alike, Erika.','https://image.tmdb.org/t/p/w500/xHYsUwUe4MaNc6mbNBGTkqZSnPk.jpg','2004-09-28',7.5,0),(17718,'Major Grom: Plague Doctor','ru','Igor Grom is a skilled policeman from St. Petersburg, known for his daring nature and uncompromising attitude towards the criminals of all kinds. Incredible strength, analytical mind and integrity – these qualities make Major Grom the perfect policeman. Working tirelessly, he always pushes through, and meets the challenges standing in the way.','https://image.tmdb.org/t/p/w500/wnesEmcq7xdw1Rm1Bn6XEFTkenR.jpg','2021-04-01',6.7,0),(17719,'Don\'t Be a Menace to South Central While Drinking Your Juice in the Hood','en','When Ashtray moves to South Central L.A. to live with his father (who appears to be the same age he is) and grandmother (who likes to talk tough and smoke reefer), he falls in with his gang-banging cousin Loc Dog, who along with the requisite pistols and Uzi carries a thermo-nuclear warhead for self-defense. Will Ashtray be able to keep living the straight life?','https://image.tmdb.org/t/p/w500/HZQBF7JDd2e9p4rPSbSHuWHaCC.jpg','1996-01-12',7,0),(17720,'From Straight A\'s to XXX','en','When a change of circumstances leaves Miriam unable to pay her college tuition, she makes a surprising decision: to start performing in adult films, using the pseudonym Belle Knox. Miriam lies to her family and her friends at school, keeping her double life a secret. But soon rumours spread and Miriam becomes the subject of vicious online attacks and unwanted attention. Miriam fights back: she talks to the media, saying her new line of work empowers her as a feminist. But her confident stand has unintended consequences. Miriam is shunned by her conservative family and her colleagues in the adult film world. One impulsive decision has quickly spiralled out of control - and Miriam\'s problems are just beginning.','https://image.tmdb.org/t/p/w500/pv5n66n3J9DzNeEzGymhQ0q2FcS.jpg','2017-02-11',5.9,0),(17721,'The Kings of the World','es','Rá, Culebro, Sere, Winny and Nano. Five boys who live on the streets of Medellín. Five kings with no kingdom, no law, no family, set out on a journey in search of the promised land. A subversive tale told through a wild and endearing clan, somewhere between reality and delirium. A journey to nowhere, where everything happens.','https://image.tmdb.org/t/p/w500/iK46b6jYIKvaakp7qKt0BKexN53.jpg','2022-10-13',7,0),(17722,'The Marksman','en','Jim Hanson’s quiet life is suddenly disturbed by two people crossing the US/Mexico border – a woman and her young son – desperate to flee a Mexican cartel. After a shootout leaves the mother dead, Jim becomes the boy’s reluctant defender. He embraces his role as Miguel’s protector and will stop at nothing to get him to safety, as they go on the run from the relentless assassins.','https://image.tmdb.org/t/p/w500/6vcDalR50RWa309vBH1NLmG2rjQ.jpg','2021-01-15',6.9,0),(17723,'The Secret Life of Pets 2','en','Max the terrier must cope with some major life changes when his owner gets married and has a baby. When the family takes a trip to the countryside, nervous Max has numerous run-ins with canine-intolerant cows, hostile foxes and a scary turkey. Luckily for Max, he soon catches a break when he meets Rooster, a gruff farm dog who tries to cure the lovable pooch of his neuroses.','https://image.tmdb.org/t/p/w500/tFC5uFGmmbLu3QqrtoMAvw7RtM4.jpg','2019-05-24',7,0),(17724,'Ted','en','John Bennett, a man whose childhood wish of bringing his teddy bear to life came true, now must decide between keeping the relationship with the bear or his girlfriend, Lori.','https://image.tmdb.org/t/p/w500/osJNr64CNyGhCzdlg6oHt3a6vNA.jpg','2012-06-29',6.4,0),(17725,'Descendants 3','en','The teenagers of Disney\'s most infamous villains return to the Isle of the Lost to recruit a new batch of villainous offspring to join them at Auradon Prep.','https://image.tmdb.org/t/p/w500/7IRy0iHdaS0JI3ng4ZYlk5gLSFn.jpg','2019-08-02',7.8,0),(17726,'Saw','en','Obsessed with teaching his victims the value of life, a deranged, sadistic serial killer abducts the morally wayward. Once captured, they must face impossible choices in a horrific game of survival. The victims must fight to win their lives back, or die trying...','https://image.tmdb.org/t/p/w500/h2x0kRZWvwpw8GvghmQUn1m1jQo.jpg','2004-10-01',7.4,0),(17727,'Let\'s Be Cops','en','It\'s the ultimate buddy cop movie except for one thing: they\'re not cops.  When two struggling pals dress as police officers for a costume party, they become neighborhood sensations.  But when these newly-minted “heroes” get tangl