 261-pound fighter who has the backing of the Soviet Union.','https://image.tmdb.org/t/p/w500/jmvpwgW5M2kduR9zB0q8qGFC4zM.jpg','1985-11-21',7.1,0),(17927,'Spartacus','en','The rebellious Thracian Spartacus, born and raised a slave, is sold to Gladiator trainer Batiatus. After weeks of being trained to kill for the arena, Spartacus turns on his owners and leads the other slaves in rebellion. As the rebels move from town to town, their numbers swell as escaped slaves join their ranks. Under the leadership of Spartacus, they make their way to southern Italy, where they will cross the sea and return to their homes.','https://image.tmdb.org/t/p/w500/biaUMHb8xsdQHlEF6rHmlKxSARy.jpg','1960-10-13',7.6,0),(17928,'Looop Lapeta','hi','When her boyfriend loses a mobster\'s cash, Savi races against the clock to save the day — if only she can break out of a curious cycle of dead ends.','https://image.tmdb.org/t/p/w500/onGdT8sYi89drvSJyEJnft97rOq.jpg','2022-02-04',6.3,0),(17929,'A Day to Die','en','A disgraced parole officer is indebted to a local gang leader and forced to pull off a series of dangerous drug heists within twelve hours in order to pay the $2 million dollars he owes, rescue his kidnapped pregnant wife, and settle a score with the city\'s corrupt police chief, who is working with the gang leader and double-crossed him years ago.','https://image.tmdb.org/t/p/w500/8Kce1utfytAG5m1PbtVoDzmDZJH.jpg','2022-03-04',6,0),(17930,'Carriers','en','A deadly virus has spread across the globe. Contagion is everywhere, no one is safe, and no one can be trusted. Four friends race through the back roads of the American West on their way to a secluded utopian beach in the Gulf of Mexico where they could peacefully wait out the pandemic. Their plans take a grim turn when their car breaks down on an isolated road starting a chain of events that will seal their fates.','https://image.tmdb.org/t/p/w500/jxjnjHtHXgvjdhkwpelE9ZwVMg6.jpg','2009-09-04',6.1,0),(17931,'Amina','en','In 16th-century Zazzau, now Zaria, Nigeria, Amina must utilize her military skills and tactics to defend her family\'s kingdom. Based on a true story.','https://image.tmdb.org/t/p/w500/hMIQiwLpBfTfe3ZbRlNx4225Mgg.jpg','2021-11-04',6.5,0),(17932,'Adanis: Kutsal Kavga','tr','','https://image.tmdb.org/t/p/w500/1G5mt3uGUW5OWUcxcBUtHm5Zdd9.jpg','2022-03-11',5.3,0),(17933,'Finding Dory','en','Dory is reunited with her friends Nemo and Marlin in the search for answers about her past. What can she remember? Who are her parents? And where did she learn to speak Whale?','https://image.tmdb.org/t/p/w500/3UVe8NL1E2ZdUZ9EDlKGJY5UzE.jpg','2016-06-16',7,0),(17934,'Rampage','en','Primatologist Davis Okoye shares an unshakable bond with George, the extraordinarily intelligent, silverback gorilla who has been in his care since birth.  But a rogue genetic experiment gone awry mutates this gentle ape into a raging creature of enormous size.  To make matters worse, it’s soon discovered there are other similarly altered animals.  As these newly created alpha predators tear across North America, destroying everything in their path, Okoye teams with a discredited genetic engineer to secure an antidote, fighting his way through an ever-changing battlefield, not only to halt a global catastrophe but to save the fearsome creature that was once his friend.','https://image.tmdb.org/t/p/w500/MGADip4thVSErP34FAAfzFBTZ5.jpg','2018-04-11',6.4,0),(17935,'Tom and Jerry: The Fast and the Furry','en','After being evicted from their old house by Tom\'s owner for causing major damage, cat and mouse Tom and Jerry enter a race entitled the \"Fabulous Super Race\" to win a mansion.','https://image.tmdb.org/t/p/w500/7PeNpz4mDyRqDxMhC0g0FCpVwPB.jpg','2005-10-11',6.9,0),(17936,'Scream 4','en','Sidney Prescott, now the author of a self-help book, returns home to Woodsboro on the last stop of her book tour. There she reconnects with Sheriff Dewey and Gale, who are now married, as well as her cousin Jill and her Aunt Kate. Unfortunately, Sidney\'s appearance also brings about the return of Ghostface, putting Sidney, Gale, and Dewey, along with Jill, her friends, and the whole town of Woodsboro in danger.','https://image.tmdb.org/t/p/w500/g0YcSd5QpgGXOjg9tl0if0soOkE.jpg','2011-04-11',6.4,0),(17937,'20/20 Presents Black Panther: In Search of Wakanda','en','Exploring the evolution of Black Panther from the comic emerging in the 1960s to the film the world fell in love with in 2018; director Ryan Coogler; Whoopi Goldberg interviews Chadwick Boseman\'s widow, Simone Ledward Boseman.','https://image.tmdb.org/t/p/w500/78zCPvK3iF1O9fDQFi9wKmqmGOK.jpg','2022-11-04',3.8,0),(17938,'Don\'t Look Up','en','Two American astronomers attempt to warn humankind about an approaching comet that will wipe out life on planet Earth.','https://image.tmdb.org/t/p/w500/th4E1yqsE8DGpAseLiUrI60Hf8V.jpg','2021-12-07',7.2,0),(17939,'Mission: Impossible - Ghost Protocol','en','Ethan Hunt and his team are racing against time to track down a dangerous terrorist named Hendricks, who has gained access to Russian nuclear launch codes and is planning a strike on the United States. An attempt to stop him ends in an explosion causing severe destruction to the Kremlin and the IMF to be implicated in the bombing, forcing the President to disavow them. No longer being aided by the government, Ethan and his team chase Hendricks around the globe, although they might still be too late to stop a disaster.','https://image.tmdb.org/t/p/w500/psiWp3VTjznfokmGQG9uqiiknQQ.jpg','2011-12-07',7.1,0),(17940,'Hotel Transylvania 2','en','When the old-old-old-fashioned vampire Vlad arrives at the hotel for an impromptu family get-together, Hotel Transylvania is in for a collision of supernatural old-school and modern day cool.','https://image.tmdb.org/t/p/w500/kKFgwQnR5q08UFsAvtoYyTIiHyj.jpg','2015-09-21',6.8,0),(17941,'Death on the Nile','en','Belgian sleuth Hercule Poirot boards a glamorous river steamer with enough champagne to fill the Nile. 