 squad after her. This battle’s about to become primitive!','https://image.tmdb.org/t/p/w500/bZnOioDq1ldaxKfUoj3DenHU7mp.jpg','2021-08-26',5.1,0),(18009,'Home Sweet Home Alone','en','After being left at home by himself for the holidays, 10-year-old Max Mercer must work to defend his home from a married couple who tries to steal back a valuable heirloom.','https://image.tmdb.org/t/p/w500/fP3VvqUjEBjawxZHL4sYCq2ZdJD.jpg','2021-11-12',5,0),(18010,'An Interview with God','en','An up-and-coming journalist finds his world and faith increasingly challenged when he\'s granted the interview of a lifetime – with someone who claims to be God.','https://image.tmdb.org/t/p/w500/d9TeB8VLCgwSph2OSYK3lcHGf1f.jpg','2018-08-20',7.1,0),(18011,'Escape Room: Tournament of Champions','en','Six people unwittingly find themselves locked in another series of escape rooms, slowly uncovering what they have in common to survive as they discover all the games that they\'ve played before.','https://image.tmdb.org/t/p/w500/jGYJyPzVgrVV2bgClI9uvEZgVLE.jpg','2021-07-01',6.7,0),(18012,'Fantastic Four','en','During a space voyage, four scientists are altered by cosmic rays: Reed Richards gains the ability to stretch his body; Sue Storm can become invisible; Johnny Storm controls fire; and Ben Grimm is turned into a super-strong … thing. Together, these \"Fantastic Four\" must now thwart the evil plans of Dr. Doom and save the world from certain destruction.','https://image.tmdb.org/t/p/w500/8HLQLILZLhDQWO6JDpvY6XJLH75.jpg','2005-06-29',5.8,0),(18013,'Dark Spell','ru','Terror strikes when a heartbroken woman uses black magic to get her husband back.','https://image.tmdb.org/t/p/w500/2AbGdSGlU6CpiV3lswHUgE5CdAA.jpg','2021-02-11',6.7,0),(18014,'Old People','de','A woman who\'s returned home with her two kids to attend her sister\'s wedding must suddenly defend their lives against older people on a killing spree.','https://image.tmdb.org/t/p/w500/nSguJmHeYv6cwTljOZduPJDTweS.jpg','2022-10-07',5.7,0),(18015,'Escape Plan 2: Hades','en','Ray Breslin manages an elite team of security specialists trained in the art of breaking people out of the world\'s most impenetrable prisons. When his most trusted operative, Shu Ren, is kidnapped and disappears inside the most elaborate prison ever built, Ray must track him down with the help of some of his former friends.','https://image.tmdb.org/t/p/w500/A6tb8JNrie2qT8JC2tGqshayuck.jpg','2018-06-05',5.1,0),(18016,'Hercules','en','Fourteen hundred years ago, a tormented soul walked the earth that was neither man nor god. Hercules was the powerful son of the god king Zeus, for this he received nothing but suffering his entire life. After twelve arduous labors and the loss of his family, this dark, world-weary soul turned his back on the gods finding his only solace in bloody battle. Over the years he warmed to the company of six similar souls, their only bond being their love of fighting and presence of death. These men and woman never question where they go to fight or why or whom, just how much they will be paid. Now the King of Thrace has hired these mercenaries to train his men to become the greatest army of all time. It is time for this bunch of lost souls to finally have their eyes opened to how far they have fallen when they must train an army to become as ruthless and blood thirsty as their reputation has become.','https://image.tmdb.org/t/p/w500/5X3VOy9lD44VclKsWTi8gHZGjhL.jpg','2014-07-23',5.8,0),(18017,'The First Purge','en','To push the crime rate below one percent for the rest of the year, the New Founding Fathers of America test a sociological theory that vents aggression for one night in one isolated community. But when the violence of oppressors meets the rage of the others, the contagion will explode from the trial-city borders and spread across the nation.','https://image.tmdb.org/t/p/w500/8qev1papxnzWVrXxZvEUqI8Z3n5.jpg','2018-07-04',6,0),(18018,'Salò, or the 120 Days of Sodom','it','Four corrupted fascist libertines round up 9 teenage boys and girls and subject them to 120 days of sadistic physical, mental and sexual torture.','https://image.tmdb.org/t/p/w500/xnaDdiRfZlJaTf6JRc4in40eaeI.jpg','1976-01-10',6.5,0),(18019,'The Core','en','Geophysicist Dr. Josh Keyes discovers that an unknown force has caused the earth\'s inner core to stop rotating. With the planet\'s magnetic field rapidly deteriorating, our atmosphere literally starts to come apart at the seams with catastrophic consequences. To resolve the crisis, Keyes, along with a team of the world\'s most gifted scientists, travel into the earth\'s core. Their mission: detonate a device that will reactivate the core.','https://image.tmdb.org/t/p/w500/jaG2vih2z4V5fP9pnYSIL65lr8d.jpg','2003-03-28',5.7,0),(18020,'The Book of Life','en','The journey of Manolo, a young man who is torn between fulfilling the expectations of his family and following his heart. Before choosing which path to follow, he embarks on an incredible adventure that spans three fantastical worlds where he must face his greatest fears.','https://image.tmdb.org/t/p/w500/aotTZos5KswgCryEzx2rlOjFsm1.jpg','2014-10-01',7.5,0),(18021,'Chronicle','en','Three high school students make an incredible discovery, leading to their developing uncanny powers beyond their understanding. As they learn to control their abilities and use them to their advantage, their lives start to spin out of control, and their darker sides begin to take over.','https://image.tmdb.org/t/p/w500/xENglsVIIWEEhhB5lgpy33tGcKI.jpg','2012-02-01',6.8,0),(18022,'Rise of the Planet of the Apes','en','A highly intelligent chimpanzee named Caeser has been living a peaceful suburban life ever since he was born. But when he gets taken to a cruel primate facility, Caeser decides to revolt against those who have harmed him.','https://image.tmdb.org/t/p/w500/cjLsuP75UDlRdJVMXzXg3TJ4umX.jpg','2011-08-03',7.3,0),(18023,'Pride & Prejudice','en','A story of love and life among the landed English gentry during 