.','https://image.tmdb.org/t/p/w500/zVJcfDu9gPjLe5p6vC6l7urlyr7.jpg','1979-09-28',5.2,0),(18034,'Those Who Wish Me Dead','en','A young boy finds himself pursued by two assassins in the Montana wilderness, with a survival expert determined to protect him, and a forest fire threatening to consume them all.','https://image.tmdb.org/t/p/w500/xCEg6KowNISWvMh8GvPSxtdf9TO.jpg','2021-05-05',6.7,0),(18035,'The Warrior\'s Way','en','A warrior-assassin is forced to hide in a small town in the American Badlands after refusing a mission.','https://image.tmdb.org/t/p/w500/kfloVZk0uGkSftjD6DI8ZWUsrrI.jpg','2010-12-01',6.6,0),(18036,'Desperate Riders','en','After Kansas Red rescues young Billy from a card-game shootout, the boy asks Red for help protecting his family from the outlaw Thorn, who’s just kidnapped Billy’s mother, Carol. As Red and Billy ride off to rescue Carol, they run into beautiful, tough-as-nails Leslie, who’s managed to escape Thorn’s men. The three race to stop Thorn’s wedding to Carol with guns a-blazing - but does she want to be rescued?','https://image.tmdb.org/t/p/w500/7pYYGm1dWZGkbJuhcuaHD6nE6k7.jpg','2022-02-25',6,0),(18037,'American Reunion','en','The characters we met a little more than a decade ago return to East Great Falls for their high-school reunion. In one long-overdue weekend, they will discover what has changed, who hasn’t, and that time and distance can’t break the bonds of friendship.','https://image.tmdb.org/t/p/w500/de5QBIdVR4dnkBZ4a0zjkS4lTg.jpg','2012-04-04',6.3,0),(18038,'White Noise','en','Jack Gladney, professor of Hitler studies at The-College-on-the-Hill, husband to Babette, and father to four children/stepchildren, is torn asunder by a chemical spill from a rail car that releases an \"Airborne Toxic Event\" forcing Jack to confront his biggest fear - his own mortality.','https://image.tmdb.org/t/p/w500/1a48bfLQm57ByADdw05uRMoFCZc.jpg','2022-11-25',5.7,0),(18039,'The Longest Yard','en','Pro quarter-back, Paul Crewe and former college 