ream vacation in a place where the sun never sets, gradually turns into a dark nightmare as the mysterious inhabitants invite them to participate in their disturbing festive activities.','https://image.tmdb.org/t/p/w500/7LEI8ulZzO5gy9Ww2NVCrKmHeDZ.jpg','2019-07-03',7.2,0),(18044,'I Spit on Your Grave III: Vengeance is Mine','en','Jennifer Hills is still tormented by the brutal sexual assault she endured years ago. She’s changed identities and cities, reluctantly joining a support group where she begins to piece together a new life. But when her new friend’s murderer goes free and the tales of serial rapists haunt her, Jennifer will hunt down the men responsible and do what the system won’t – make them pay for their crimes in the most horrific ways imaginable. Only this time, no jury may be able to save her.','https://image.tmdb.org/t/p/w500/jG5GDIcqiqHXkvINZSjyzBUO2vH.jpg','2015-10-01',5.7,0),(18045,'Veneciafrenia','es','A group of spanish tourists in Venice finds themselves fighting for their lives against locals that are not too keen on foreigners.','https://image.tmdb.org/t/p/w500/luMC56bwZqaECYRz6X7sXjqN6nd.jpg','2022-04-22',6.1,0),(18046,'Run Sweetheart Run','en','A woman runs for her life though the streets of Los Angeles after her blind date suddenly turns violent.','https://image.tmdb.org/t/p/w500/9xf3aiAxjx2H34EwwVFFlOrr0nt.jpg','2020-01-27',5.9,0),(18047,'Barbie: Princess Charm School','en','Barbie stars as Blair Willows, a kind-hearted girl who is chosen to attend Princess Charm School: a magical, modern place that teaches dancing, how to have tea parties, and proper princess manners. Blair loves her classes -- as well as the helpful magical sprites and her new friends, Princesses Hadley and Isla. But when royal teacher Dame Devin discovers that Blair looks a lot like the kingdom’s missing princess, she turns Blair’s world upside down to stop her from claiming the throne. Now Blair, Hadley and Delancy must find an enchanted crown to prove Blair’s true ide