wn hotshot crew. Among them is the cocksure A.J. who Harry thinks isn\'t good enough for his daughter, until the mission proves otherwise.','https://image.tmdb.org/t/p/w500/eTM3qtGhDU8cvjpoa6KEt5E2auU.jpg','1998-07-01',6.8,0),(18081,'Descendants 2','en','When the pressure to be royal becomes too much for Mal, she returns to the Isle of the Lost where her archenemy Uma, Ursula\'s daughter, has taken her spot as self-proclaimed queen.','https://image.tmdb.org/t/p/w500/8BNyZlBk4Hs92z6UrvFDjvx3yMb.jpg','2017-07-21',7.4,0),(18082,'Gridiron Gang','en','Teenagers at a juvenile detention center, under the leadership of their counselor, gain self-esteem by playing football together.','https://image.tmdb.org/t/p/w500/icv6qe7nhiGV914nf1WEr8wHy7m.jpg','2006-09-15',7,0),(18083,'The Boy in the Striped Pyjamas','en','When his family moves from their home in Berlin to a strange new house in Poland, young Bruno befriends Shmuel, a boy who lives on the other side of the fence where everyone seems to be wearing striped pajamas. Unaware of Shmuel\'s fate as a Jewish prisoner or the role his own Nazi father plays in his imprisonment, Bruno embarks on a dangerous journey inside the camp\'s walls.','https://image.tmdb.org/t/p/w500/2C8QCXdMlojTxZjfBlINr4FWcb6.jpg','2008-05-07',7.8,0),(18084,'The Kissing Booth','en','When teenager Elle\'s first kiss leads to a forbidden romance with the hottest boy in high school, she risks her relationship with her best friend.','https://image.tmdb.org/t/p/w500/7Dktk2ST6aL8h9Oe5rpk903VLhx.jpg','2018-05-11',7.3,0),(18085,'Unhinged','en','A divorced mother honks impatiently at a deranged middle-aged stranger at a red light while running late on her way to work. His road rage escalates to horrifyingly psychotic proportions as he becomes single-mindedly determined to teach her a deadly lesson for provoking him.','https://image.tmdb.org/t/p/w500/6WC3cIhuaLZSq3SbtdOp2ZTSTe.jpg','2020-07-16',6.4,0),(18086,'Diary of a Wimpy Kid','en','Greg Heffley is a scrawny but