n to steal this year\'s award. The evil fashion guru Mugatu seizes the opportunity to turn Derek into a killing machine. It\'s a well-designed conspiracy and only with the help of Hansel and a few well-chosen accessories like Matilda can Derek make the world safe for male models everywhere.','https://image.tmdb.org/t/p/w500/qdrbSneHZjJG2Dj0hhBxzzAo4HB.jpg','2001-09-28',6.2,0),(18092,'1976','es','Chile, 1976. Carmen heads off to her beach house to supervise its renovation. Her husband, children and grandchildren come back and forth during the winter vacation. When the family priest asks her to take care of a young man he is sheltering in secret, Carmen steps onto unexplored territories, away from the quiet life she is used to.','https://image.tmdb.org/t/p/w500/vlL3vY9Z1mBF2Uzi4Grfl9uCKOX.jpg','2023-02-16',0,0),(18093,'Devil of Rape','cn','A rich, but bored man is possessed by an evil spirit that causes him to seduce and rape women.','https://image.tmdb.org/t/p/w500/w1fNvo5BCsb7dnlczGgtsNbB3wQ.jpg','1992-10-28',0,0),(18094,'War for the Planet of the Apes','en','Caesar and his apes are forced into a deadly conflict with an army of humans led by a ruthless Colonel. After the apes suffer unimaginable losses, Caesar wrestles with his darker instincts and begins his own mythic quest to avenge his kind. As the journey finally brings them face to face, Caesar and the Colonel are pitted against each other in an epic battle that will determine the fate of both their species and the future of the planet.','https://image.tmdb.org/t/p/w500/ijQHiImv16vNSeZQsmih04kwn0C.jpg','2017-07-11',7.1,0),(18095,'A Serbian Film','sr','Milos, a retired porn star, leads a normal family life trying to make ends meet. Presented with the opportunity of a lifetime to financially support his family for the rest of their lives, Milos must participate in one last mysterious film. From then on, Milos is drawn into a maelstrom of unbelievable cruelty and mayhem.','https://image.tmdb.org/t/p/w500/yIQqiw3A