s that follow send their lives in completely different directions. As each navigates the complexities of life, love, and everything in between, they always find their way back to each other - but is it just friendship, or something more?','https://image.tmdb.org/t/p/w500/rpD0t7DhzJVadnzgxSYrqljQTL2.jpg','2014-10-16',7.8,0),(18103,'Final Destination 3','en','A student\'s premonition of a deadly rollercoaster ride saves her life and a lucky few, but not from death itself – which seeks out those who escaped their fate.','https://image.tmdb.org/t/p/w500/p7ARuNKUGPGvkBiDtIDvAzYzonX.jpg','2006-02-09',6.1,0),(18104,'Three Thousand Years of Longing','en','A solitary scholar discovers an ancient bottle while on a trip to Istanbul and unleashes a djinn who offers her three wishes. Filled with reluctance, she is unable to come up with one, so the djinn tries to inspire her with his stories.','https://image.tmdb.org/t/p/w500/znTc7lqc7vrRLwAH7eRjbv6OQgS.jpg','2022-08-24',7.1,0),(18105,'Home','en','When Earth is taken over by the overly-confident Boov, an alien race in search of a new place to call home, all humans are promptly relocated, while all Boov get busy reorganizing the planet. But when one resourceful girl, Tip, manages to avoid capture, she finds herself the accidental accomplice of a banished Boov named Oh. The two fugitives realize there’s a lot more at stake than intergalactic relations as they embark on the road trip of a lifetime.','https://image.tmdb.org/t/p/w500/ln7DqfqyKosTw1xoa92Q7FRT3Jh.jpg','2015-03-18',6.8,0),(18106,'Hocus Pocus','en','After 300 years of slumber, three sister witches are accidentally resurrected in Salem on Halloween night, and it is up to three kids and their newfound feline friend to put an end to the witches\' reign of terror once and for all.','https://image.tmdb.org/t/p/w500/by4D4Q9NlUjFSEUA1yrxq6ksXmk.jpg','1993-07-16',7.1,0),(18107,'Edward Scissorhands','en','A small suburban town receives a visit from a castaway unfinished science e