r-old girl and her mother live among a community that has claimed the abandoned subway tunnels as their home. After a sudden police-mandated eviction, the pair are forced to flee aboveground into a brutal winter night. Determined to return home, they fight to find shelter as their world is thrown into chaos.','https://image.tmdb.org/t/p/w500/mcDGQ2nBftKijYVNFcm0rWsaPiU.jpg','2022-03-25',7,0),(18112,'The SpongeBob Movie: Sponge Out of Water','en','Burger Beard is a pirate who is in search of the final page of a magical book that makes any evil plan he writes in it come true, which happens to be the Krabby Patty secret formula. When the entire city of Bikini Bottom is put in danger, SpongeBob, Patrick, Mr. Krabs, Squidward, Sandy, and Plankton need to go on a quest that takes them to the surface. In order to get back the recipe and save their city, the gang must retrieve the book and transform themselves into superheroes.','https://image.tmdb.org/t/p/w500/2WDmjUlSAPlA27i2OwEC7sRTFw3.jpg','2015-01-28',6,0),(18113,'The Imitation Game','en','Based on the real life story of legendary cryptanalyst Alan Turing, the film portrays the nail-biting race against time by Turing and his brilliant team of code-breakers at Britain\'s top-secret Government Code and Cypher School at Bletchley Park, during the darkest days of World War II.','https://image.tmdb.org/t/p/w500/zSqJ1qFq8NXFfi7JeIYMlzyR0dx.jpg','2014-11-14',8,0),(18114,'Umma','en','Amanda and her daughter live a quiet life on an American farm, but when the remains of her estranged mother arrive from Korea, Amanda becomes haunted by the fear of turning into her own mother.','https://image.tmdb.org/t/p/w500/moLnqJmZ00i2opS0bzCVcaGC0iI.jpg','2022-03-18',5.5,0),(18115,'Level 16','en','The teenage girls of Vestalis Academy are meticulously trained in the art of being “clean girls,” practicing the virtues of perfect femininity. But what exactly are they being trained for? Vivien intends to find out.','https://image.tmdb.org/t/p/w5