-11',5.7,0),(18166,'2001: A Space Odyssey','en','Humanity finds a mysterious object buried beneath the lunar surface and sets off to find its origins with the help of HAL 9000, the world\'s most advanced super computer.','https://image.tmdb.org/t/p/w500/ve72VxNqjGM69Uky4WTo2bK6rfq.jpg','1968-04-02',8.1,0),(18167,'G.I. Joe: The Rise of Cobra','en','From the Egyptian desert to deep below the polar ice caps, the elite G.I. JOE team uses the latest in next-generation spy and military equipment to fight the corrupt arms dealer Destro and the growing threat of the mysterious Cobra organization to prevent them from plunging the world into chaos.','https://image.tmdb.org/t/p/w500/mc9b25IAprHfsaOz0wTshOwGHcY.jpg','2009-08-03',5.8,0),(18168,'Prince of Persia: The Sands of Time','en','A rogue prince reluctantly joins forces with a mysterious princess and together, they race against dark forces to safeguard an ancient dagger capable of releasing the Sands of Time – gift from the gods that can reverse time and allow its possessor to rule the world.','https://image.tmdb.org/t/p/w500/lkp1GFmWyf7k2WKvKIQuuGyichI.jpg','2010-05-19',6.3,0),(18169,'50 First Dates','en','Henry is a player skilled at seducing women. But when this veterinarian meets Lucy, a girl with a quirky problem when it comes to total recall, he realizes it\'s possible to fall in love all over again…and again, and again. That\'s because the delightful Lucy has no short-term memory, so Henry must woo her day after day until he finally sweeps her off her feet.','https://image.tmdb.org/t/p/w500/5NxTW4SS6aUKZYnbQzh7UYNivd.jpg','2004-02-13',6.8,0),(18170,'The Painted House','ml','An old and lonely writer\'s life is turned around when a young woman comes into his life and one day a uninvited guest comes and makes things more complicated.','https://image.tmdb.org/t/p/w500/milQQcApBicb9x4ishCMA5zYz8c.jpg','2015-12-04',4.1,0),(18171,'The Lorax','en','A 12-year-old boy searches for the one thing that will enable him to win the affection of the girl of his dreams. To find it he must discover the story of the Lorax, the grumpy yet charming creature who fights to protect his world.','https://image.tmdb.org/t/p/w500/tePFnZFw5JvjwjQjaKkqDPNMLPU.jpg','2012-03-01',6.5,0),(18172,'Aquaman and the Lost Kingdom','en','When an ancient power is unleashed, Aquaman must forge an uneasy alliance with an unlikely ally to protect Atlantis, and the world, from irreversible devastation.','https://image.tmdb.org/t/p/w500/c5j0o2oMo0uuKTXv08exBObALPM.jpg','2023-12-20',0,0),(18173,'Warcraft','en','The peaceful realm of Azeroth stands on the brink of war as its civilization faces a fearsome race of invaders: orc warriors fleeing their dying home to colonize another. As a portal opens to connect the two worlds, one army faces destruction and the other faces extinction. From opposing sides, two heroes are set on a collision course that will decide the fate of their family, their people, and their home.','https://image.tmdb.org/t/p/w500/nZIIOs06YigBnvmlJ2hxZeA8eTO.jpg','2016-05-25',6.4,0),(18174,'Die Hard','en','NYPD cop John McClane\'s plan to reconcile with his estranged wife is thrown for a serious loop when, minutes after he arrives at her office, the entire building is overtaken by a group of terrorists. With little help from the LAPD, wisecracking McClane sets out to single-handedly rescue the hostages and bring the bad guys down.','https://image.tmdb.org/t/p/w500/yFihWxQcmqcaBR31QM6Y8gT6aYV.jpg','1988-07-15',7.8,0),(18175,'The Munsters','en','Lily is a typical 150-year-old lovelorn vampire who\'s looking for the man of her nightmares -- until she lays her eyes on Herman, a 7-foot-tall green experiment with a heart of gold. It\'s love at first shock as these two ghouls fall fangs over feet for each other in a Transylvanian romance. Unfortunately, it\'s not all smooth sailing in the cemetery as Lily\'s father has other plans for his beloved daughter\'s future, and they don\'t involve her new bumbling beau.','https://image.tmdb.org/t/p/w500/kJaEVFhDouD72GKANMkYqzQky9n.jpg','2022-09-27',5.9,0),(18176,'Infinite Storm','en','One woman\'s journey for self-discovery and turns into a harrowing tale of survival.','https://image.tmdb.org/t/p/w500/4B34NKfHCFVHriYfKhbsunHYl4x.jpg','2022-03-25',6.1,0),(18177,'The Quake','no','A geologist races against time to save his estranged wife and two children when a devastating earthquake strikes Oslo, Norway.','https://image.tmdb.org/t/p/w500/jA5MVaNWe76EjuXn4FqkeaHDPuj.jpg','2018-08-31',6.8,0),(18178,'The Curious Case of Benjamin Button','en','I was born under unusual circumstances. And so begins The Curious Case of Benjamin Button, adapted from the 1920s story by F. Scott Fitzgerald about a man who is born in his eighties and ages backwards: a man, like any of us, who is unable to stop time. We follow his story, set in New Orleans, from the end of World War I in 1918 into the 21st century, following his journey that is as unusual as any man\'s life can be. Benjamin Button, is a grand tale of a not-so-ordinary man and the people and places he discovers along the way, the loves he finds, the joys of life and the sadness of death, and what lasts beyond time.','https://image.tmdb.org/t/p/w500/9H2awZmNisMVJGp362Stv0bfUTs.jpg','2008-12-25',7.6,0),(18179,'Escape Plan','en','Ray Breslin is the world\'s foremost authority on structural security. After analyzing every high security prison and learning a vast array of survival skills so he can design escape-proof prisons, his skills are put to the test. He\'s framed and incarcerated in a master prison he designed himself. He needs to escape and find the person who put him behind bars.','https://image.tmdb.org/t/p/w500/wAxvnvx1Jyx7dxnpq3yOY9JWIkS.jpg','2013-10-09',6.7,0),(18180,'The Purge: Election Year','en','Two years after choosing not to kill the man who killed his son, former police sergeant Leo Barnes has become head of security for Senator Charlene Roan, the front runner in the next Presidential election due to her vow to eliminate the Purge. On the night of what should be the final Purge, a betrayal from within the government forces Barnes and Roan out onto the street where they must fight to survive the night.','https://image.tmdb.org/t/p/w500/dx5pKJpGbJc9xrFQ8UR1XrrqmPj.jpg','2016-06-29',6.4,0),(18181,'The Wrath of God','es','Convinced the tragic deaths of her loved ones were orchestrated by a famous novelist she worked for, Luciana turns to a journalist to expose her truth.','https://image.tmdb.org/t/p/w500/lFhxNXEK0UpXXqSbhba83Zhl2uk.jpg','2022-06-15',6.4,0),(18182,'The Angry Birds Movie 2','en','Red, Chuck, Bomb and the rest of their feathered friends are surprised when a green pig suggests that they put aside their differences and unite to fight a common threat. Aggressive birds from an island covered in ice are planning to use an elaborate weapon to destroy the fowl and swine.','https://image.tmdb.org/t/p/w500/ebe8hJRCwdflNQbUjRrfmqtUiNi.jpg','2019-08-02',7.1,0),(18183,'Skyfall','en','When Bond\'s latest assignment goes gravely wrong, agents around the world are exposed and MI6 headquarters is attacked. While M faces challenges to her authority and position from Gareth Mallory, the new Chairman of the Intelligence and Security Committee, it\'s up to Bond, aided only by field agent Eve, to locate the mastermind behind the attack.','https://image.tmdb.org/t/p/w500/d0IVecFQvsGdSbnMAHqiYsNYaJT.jpg','2012-10-24',7.2,0),(18184,'Straight Outta Compton','en','In 1987, five young men, using brutally honest rhymes and hardcore beats, put their frustration and anger about life in the most dangerous place in America into the most powerful weapon they had: their music.  Taking us back to where it all began, Straight Outta Compton tells the true story of how these cultural rebels—armed only with their lyrics, swagger, bravado and raw talent—stood up to the authorities that meant to keep them down and formed the world’s most dangerous group, N.W.A.  And as they 