ches down.','https://image.tmdb.org/t/p/w500/6Biy7R9LfumYshur3YKhpj56MpB.jpg','2005-06-28',6.5,0),(18194,'300','en','Based on Frank Miller\'s graphic novel, \"300\" is very loosely based the 480 B.C. Battle of Thermopylae, where the King of Sparta led his army against the advancing Persians; the battle is said to have inspired all of Greece to band together against the Persians, and helped usher in the world\'s first democracy.','https://image.tmdb.org/t/p/w500/9W49fy5G7v9Ed3CXtvMi41YqZtt.jpg','2007-03-07',7.2,0),(18195,'Dive','es','Mariel is a veteran elite diver who has one last chance at the Olympic Games. However, when a terrible truth comes to light, Mariel faces her biggest personal question: Is winning her true dream?','https://image.tmdb.org/t/p/w500/aVMvi2I6jvWD4WpL7bLuwU7qmPY.jpg','2022-10-24',7.9,0),(18196,'Overboard','en','A spoiled, wealthy yacht owner is thrown overboard and becomes the target of revenge from his mistreated employee.','https://image.tmdb.org/t/p/w500/41Rzkgo9y7n6BNGD6O8j0LVs8Yu.jpg','2018-04-13',6.7,0),(18197,'Blood Red Sky','de','A woman with a mysterious illness is forced into action when a group of terrorists attempt to hijack a transatlantic overnight flight. In order to protect her son she will have to reveal a dark secret, and unleash the inner monster she has fought to hide.','https://image.tmdb.org/t/p/w500/v7aOJKI5vxCHotHvN8O7SR6SpP6.jpg','2021-07-23',7,0),(18198,'The Impossible','en','In December 2004, close-knit family Maria, Henry and their three sons begin their winter vacation in Thailand. But the day after Christmas, the idyllic holiday turns into an incomprehensible nightmare when a terrifying roar rises from the depths of the sea, followed by a wall of black water that devours everything in its path. Though Maria and her family face their darkest hour, unexpected displays of kindness and courage ameliorate their terror.','https://image.tmdb.org/t/p/w500/k0DLCiDbnYywOHiISALbl2EH2NE.jpg','2012-09-09',7.4,0),(18199,'Bad Boys II','en','Out-of-control, trash-talking buddy cops Marcus Burnett and Mike Lowrey of the Miami Narcotics Task Force reunite, and bullets fly, cars crash and laughs explode as they pursue a whacked-out drug lord from the streets of Miami to the barrios of Cuba. But the real fireworks result when Marcus discovers that playboy Mike is secretly romancing Marcus’ sexy sister.','https://image.tmdb.org/t/p/w500/yCvB5fG5aEPqa1St7ihY6KEAsHD.jpg','2003-07-18',6.6,0),(18200,'Cloudy with a Chance of Meatballs','en','Inventor Flint Lockwood creates a machine that makes clouds rain food, enabling the down-and-out citizens of Chewandswallow to feed themselves. But when the falling food reaches gargantuan proportions, Flint must scramble to avert disaster. Can he regain control of the machine and put an end to the wild weather before the town is destroyed?','https://image.tmdb.org/t/p/w500/qhOhIKf7QEyQ5dMrRUqs5eTX1Oq.jpg','2009-09-17',6.6,0),(18201,'Kick-Ass','en','Dave Lizewski is an unnoticed high school student and comic book fan who one day decides to become a super-hero, even though he has no powers, training or meaningful reason to do so.','https://image.tmdb.org/t/p/w500/8citjdBmjddZjlPsAHEyCKwGVvD.jpg','2010-03-22',7.1,0),(18202,'6 Underground','en','After faking his death, a tech billionaire recruits a team of international operatives for a bold and bloody mission to take down a brutal dictator.','https://image.tmdb.org/t/p/w500/lnWkyG3LLgbbrIEeyl5mK5VRFe4.jpg','2019-12-13',6.3,0),(18203,'American Pie Presents: The Naked Mile','en','When Erik Stifler realizes that he\'s the only Stifler family member who might graduate high school a virgin, he decides to live up to his legacy. After some well-meaning advice from Jim\'s dad, Erik\'s ready to take his chances at the annual and infamous Naked Mile race, where his devoted friends and some uninhibited sorority girls will create the most outrageous weekend ever.','https://image.tmdb.org/t/p/w500/sreeL5kKj47oofEGVtDKTAcUDY6.j