ort fuse, and uses her gut instinct and street smarts to catch the most elusive criminals. Neither has ever had a partner, or a friend for that matter. When these two wildly incompatible law officers join forces to bring down a ruthless drug lord, they become the last thing anyone expected: buddies.','https://image.tmdb.org/t/p/w500/yERBa1y5zNUOTRKQPiDCPIc2fuv.jpg','2013-06-27',6.6,0),(18208,'Aliens vs Predator: Requiem','en','The iconic creatures from two of the scariest film franchises in movie history wage their most brutal battle ever—in our own backyard. The small town of Gunnison, Colorado becomes a war zone between two of the deadliest extra-terrestrial life forms—the Alien and the Predator. When a Predator scout ship crash-lands in the hills outside the town, Alien Facehuggers and a hybrid Alien/Predator are released and begin to terrorize the town.','https://image.tmdb.org/t/p/w500/d3xsKYqRO1Ys5UddRstbeb0Kf95.jpg','2007-12-25',5.1,0),(18209,'Focus','en','Nicky, an accomplished con artist, gets romantically involved with his disciple Jess but later ends their relationship. Years later, she returns as a femme fatale to spoil his plans.','https://image.tmdb.org/t/p/w500/dUg8JUT4qkOj9g0XAXrfvOuHFNm.jpg','2015-02-25',6.9,0),(18210,'Father Stu','en','The true-life story of boxer-turned-priest. When an injury ends his amateur boxing career, Stuart Long moves to Los Angeles to find money and fame. While scraping by as a supermarket clerk, he meets Carmen, a Sunday school teacher who seems immune to his bad-boy charm. Determined to win her over, the longtime agnostic starts going to church to impress her. However, a motorcycle accident leaves him wondering if he can use his second chance to help others, leading to the surprising realization that he\'s meant to be a Catholic priest.','https://image.tmdb.org/t/p/w500/pLAeWgqXbTeJ2gQtNvRmdIncYsk.jpg','2022-04-13',7.4,0),(18211,'Back to the Future Part II','en','Marty and Doc are at it again in this wacky sequel to the 