e Rescue','en','A royal relative steals a gem with the power to make things fly, the Paw Patrol takes to the skies to stop him and save Barkingburg.','https://image.tmdb.org/t/p/w500/syNuGBDLudvPYIKdgmg6sUcxk9p.jpg','2020-09-10',7,0),(18246,'Joseph: King of Dreams','en','In this animated retelling of the story from the Bible\'s Book of Genesis, Joseph\'s gift of dream interpretation and his brilliantly colored coat inspires jealousy in his brothers.','https://image.tmdb.org/t/p/w500/sUKImRHScrjrvaG2FwxCRY5ldtx.jpg','2000-11-07',6.7,0),(18247,'Ivy + Bean: The Ghost That Had to Go','en','Cold, white mist. Clanking pipes. And an eerie voice that\'s coming from the drain. Is the school bathroom... haunted? Ivy and Bean are on the case!','https://image.tmdb.org/t/p/w500/izm0ZVZlv7d2k9UAJKbwratJkFb.jpg','2022-09-02',6.7,0),(18248,'Prisoners','en','Keller Dover faces a parent\'s worst nightmare when his 6-year-old daughter, Anna, and her friend go missing. The only lead is an old motorhome that had been parked on their street. The head of the investigation, Detective Loki, arrests the driver, but a lack of evidence forces Loki to release his only suspect. Dover, knowing that his daughter\'s life is at stake, decides that he has no choice but to take matters into his own hands.','https://image.tmdb.org/t/p/w500/tJE5Xs8Z1ZQPNBv71AWZ95L1o6C.jpg','2013-09-18',8.1,0),(18249,'Pretty Baby','en','Hattie, a New Orleans prostitute, meets a photographer named Bellocq at her brothel one night and, after he photographs her, he befriends her 12-year-old daughter, Violet. When Violet is brought on as a working girl by her mother\'s madam and Hattie skips town to get married, Violet quickly loses her innocence and focuses on reuniting with Bellocq. But a life with Bellocq is compromised for Violet after her mother returns to town.','https://image.tmdb.org/t/p/w500/fn3bbYQAt81sWXbhvCZCdoa4ggi.jpg','1978-04-05',6.9,0),(18250,'SAS: Red Notice','en','An off-duty SAS soldier, Tom Buckingham, must thwart a terror attack on a train running through the Channel Tunnel. As the action escalates on the train, events transpire in the corridors of power that may make the difference as to whether Buckingham and the civilian passengers make it out of the tunnel alive.','https://image.tmdb.org/t/p/w500/6Y9fl8tD1xtyUrOHV2MkCYTpzgi.jpg','2021-08-11',5.8,0),(18251,'La La Land','en','Mia, an aspiring actress, serves lattes to movie stars in between auditions and Sebastian, a jazz musician, scrapes by playing cocktail party gigs in dingy bars, but as success mounts they are faced with decisions that begin to fray the fragile fabric of their love affair, and the dreams they worked so hard to maintain in each other threaten to rip them apart.','https://image.tmdb.org/t/p/w500/uDO8zWDhfWwoFdKS4fzkUJt0Rf0.jpg','2016-11-29',7.9,0),(18252,'Lord of War','en','Yuri Orlov is a globetrotting arms dealer and, through some of the deadliest war zones, he struggles to stay one step ahead of a relentless Interpol agent, his business rivals and even some of his customers who include many of the world\'s most notorious dictators. Finally, he must also face his own conscience.','https://image.tmdb.org/t/p/w500/3MGQD4yXokufNlW1AyRXdiy7ytP.jpg','2005-09-16',7.3,0),(18253,'Horrible Bosses 2','en','Dale, Kurt and Nick decide to start their own business but things don\'t go as planned because of a slick investor, prompting the trio to pull off a harebrained and misguided kidnapping scheme.','https://image.tmdb.org/t/p/w500/boBOkwIqgrs8noxBUSDkkicKa4K.jpg','2014-11-26',6.2,0),(18254,'Guardians of the Galaxy','en','Light years from Earth, 26 years after being abducted, Peter Quill finds himself the prime target of a manhunt after discovering an orb wanted by Ronan the Accuser.','https://image.tmdb.org/t/p/w500/r7vmZjiyZw9rpJMQJdXpjgiCOk9.jpg','2014-07-30',7.9,0),(18255,'Cinderella III: A Twist in Time','en','When Lady Tremaine steals the Fairy Godmother\'s wand and changes history, it\'s up to C