n','en','When the White House (Secret Service Code: \"Olympus\") is captured by a terrorist mastermind and the President is kidnapped, disgraced former Presidential guard Mike Banning finds himself trapped within the building. As the national security team scrambles to respond, they are forced to rely on Banning\'s inside knowledge to help retake the White House, save the President and avert an even bigger disaster.','https://image.tmdb.org/t/p/w500/ei2qjTiDpgKGuoSEntPCSAIhuvQ.jpg','2013-03-20',6.4,0),(18303,'Barbie: A Fashion Fairytale','en','Join Barbie in a colourful, modern-day fairytale filled with fashion, friends and fun! Barbie and her dog Sequin jet off to visit her Aunt\'s amazing fashion house in Paris, and much to her surprise it\'s about to be shut down forever. After she discovers three enchanting Flairies with sparkle-magic powers, Barbie comes up with a brilliant idea to save the business. She even inspires Alice, a shy fashion designer, and together they create a dazzling runway fashion show. Barbie shows that magic happens when you believe in yourself.','https://image.tmdb.org/t/p/w500/bFnf8f8DXdCANQ7Y62djgubhh4P.jpg','2010-09-14',7.2,0),(18304,'Jigsaw','en','Dead bodies begin to turn up all over the city, each meeting their demise in a variety of grisly ways. All investigations begin to point the finger at deceased killer John Kramer.','https://image.tmdb.org/t/p/w500/2mUqHJG7ZiGwZYIylczFCsRPbXM.jpg','2017-10-26',6.2,0),(18305,'My Girl','en','Vada Sultenfuss is obsessed with death. Her mother is dead, and her father runs a funeral parlor. She is also in love with her English teacher, and joins a poetry class over the summer just to impress him. Thomas J., her best friend, is \"allergic to everything\", and sticks with Vada despite her hangups. When Vada\'s father hires Shelly, and begins to fall for her, things take a turn to the worse...','https://image.tmdb.org/t/p/w500/qyJJNHteA7BUwQSey05t7qP4vRV.jpg','1991-01-01',7.4,0),(18306,'Willy Wonka & t