hers for the royal wedding of Rapunzel and Flynn. However, when Pascal and Maximus, as flower chameleon and ring bearer, respectively, lose the gold bands, a frenzied search and recovery mission gets underway. As the desperate duo tries to find the rings before anyone discovers that they’re missing, they leave behind a trail of comical chaos that includes flying lanterns, a flock of doves, a wine barrel barricade and a very sticky finale. Will Maximus and Pascal save the day and make it to the church in time? And will they ever get Flynn’s nose right?','https://image.tmdb.org/t/p/w500/5IeMW79OxftIUoR5duxyQ4LW5Iy.jpg','2012-01-13',7.1,0),(18324,'Offseason','en','Upon receiving a mysterious letter that her mother\'s grave has been vandalized, Marie travels to the desolate island town where she\'s buried. Just as she arrives, the island closes for the season, leaving Marie trapped in a nightmare.','https://image.tmdb.org/t/p/w500/zlX4WdEMzVomRukPjVQx6U9jtBS.jpg','2022-03-11',5.7,0),(18325,'Bee Movie','en','Barry B. Benson, a bee who has just graduated from college, is disillusioned at his lone career choice: making honey. On a special trip outside the hive, Barry\'s life is saved by Vanessa, a florist in New York City. As their relationship blossoms, he discovers humans actually eat honey, and subsequently decides to sue us.','https://image.tmdb.org/t/p/w500/tX2mgKFUkzFMZingSVD4vioZNz2.jpg','2007-11-02',6,0),(18326,'Braveheart','en','Enraged at the slaughter of Murron, his new bride and childhood love, Scottish warrior William Wallace slays a platoon of the local English lord\'s soldiers. This leads the village to revolt and, eventually, the entire country to rise up against English rule.','https://image.tmdb.org/t/p/w500/or1gBugydmjToAEq7OZY0owwFk.jpg','1995-03-14',7.9,0),(18327,'The Ritual','en','A group of college friends reunite for a trip to the forest, but encounter a menacing presence in the woods that\'s stalking them.','https://image.tmdb.org/t/p/w500/hHuJqzby