ie Sullivan, the daughter of the town\'s minister. Jamie has a \"to-do\" list for her life and also a very big secret she must keep from Landon.','https://image.tmdb.org/t/p/w500/8lUYMvWdHA0Q0k5F76RQCeCBUkA.jpg','2002-01-25',7.7,0),(18429,'Yu Pui Tsuen II','cn','Before Michael Mak’s Sex And Zen became a cult favourite in the ’90s, there was Ho Fan’s Yu Pui Tsuen (The Carnal Prayer Mat, 1987). But without sex bomb Amy Yip, coarse humour or lesbian love affairs, Yu Pui Tsuen had to rely on the nudity and sex from his cast of relative unknowns to save the day.  When a young man dreams that he drowns after a night of carnal passion, he asks a buddhist monk to translate the experience for him. The monk replies that the dream is a warning not to indulge the pleasures of the flesh to excess, but the man ignores his advice, marrying a virgin and making love to her constantly. However, after several torrid affairs, the man begins to realise the sagacity of the monk\'s warning.','https://image.tmdb.org/t/p/w500/u7CGXhUV9MUxjJdjLy4mHbDVUfX.jpg','1987-10-01',6,0),(18430,'Skylines','en','When a virus threatens to turn the now earth-dwelling friendly alien hybrids against humans, Captain Rose Corley must lead a team of elite mercenaries on a mission to the alien world in order to save what\'s left of humanity.','https://image.tmdb.org/t/p/w500/2W4ZvACURDyhiNnSIaFPHfNbny3.jpg','2020-10-25',5.6,0),(18431,'The Hole in the Fence','es','As every year, the Los Pinos school, a prestigious school of the confessional type, sends its students on retreat to the countryside. Under the watchful eye of teachers and priests, the children are led on the path of their physical and moral development. Through the gaze of several middle and upper class teenagers, the film shows how their upbringing affects the future of society itself.','https://image.tmdb.org/t/p/w500/shMyDFucUDxlELBxbnbvoBfHd6X.jpg','2021-10-04',6,0),(18432,'Watchmen','en','In a gritty and alternate 1985 the glory days of costumed