g country girl comes to town and works in a brothel in order to help her fiance get the money to start his own business. \"Paprika\" is the name given to her by the madam.','https://image.tmdb.org/t/p/w500/jwlo74haG1XNmp5IdSJ5Gy3KuIm.jpg','1991-02-13',7,0),(18444,'Proximity','en','A young NASA JPL scientist is abducted by extraterrestrials but when no one believes his story he becomes obsessed with finding proof which leads him on a journey of discovery.','https://image.tmdb.org/t/p/w500/nto7dx8vmqESDU484huGoSt4o48.jpg','2020-05-15',6.2,0),(18445,'The Lost Patient','fr','The 19 years old Thomas wakes up in a hospital after three years in a coma. He doesn\'t remember anything. The psychologist Anna tells him that his family has been murdered and that he is the only survivor of the massacre while his sister Laura is still missing.','https://image.tmdb.org/t/p/w500/tHwGtD4zT0IhKdc2JQNxHAJFGWn.jpg','2022-10-21',6,0),(18446,'Beyond Infinity: Buzz and the Journey to Lightyear','en','Explore the evolution of Buzz Lightyear from toy to human in the making of Pixar’s Lightyear. Dive into the origin and cultural impact of everyone’s favorite Space Ranger, the art of designing a new “human Buzz,” and the challenges faced by the Lightyear crew along the way.','https://image.tmdb.org/t/p/w500/mnp0INIjyWt4AziWmTHgPk9IFoE.jpg','2022-06-10',7,0),(18447,'Texas Chainsaw 3D','en','A young woman learns that she has inherited a Texas estate from her deceased grandmother. After embarking on a road trip with friends to uncover her roots, she finds she is the sole owner of a lavish, isolated Victorian mansion. But her newfound wealth comes at a price as she stumbles upon a horror that awaits her in the mansion’s dank cellars.','https://image.tmdb.org/t/p/w500/qaPvvHP1kKlQaUAXQZQAWitqBOT.jpg','2013-01-03',5.5,0),(18448,'Enola Holmes','en','While searching for her missing mother, intrepid teen Enola Holmes uses her sleuthing skills to outsmart big brother Sherlock and help a runaway lord.','