',6.4,0),(18458,'The Hunger Games','en','Every year in the ruins of what was once North America, the nation of Panem forces each of its twelve districts to send a teenage boy and girl to compete in the Hunger Games.  Part twisted entertainment, part government intimidation tactic, the Hunger Games are a nationally televised event in which “Tributes” must fight with one another until one survivor remains.  Pitted against highly-trained Tributes who have prepared for these Games their entire lives, Katniss is forced to rely upon her sharp instincts as well as the mentorship of drunken former victor Haymitch Abernathy.  If she’s ever to return home to District 12, Katniss must make impossible choices in the arena that weigh survival against humanity and life against love. The world will be watching.','https://image.tmdb.org/t/p/w500/mgZKtOvxtDX5HtUa5fAVQ5d1Afh.jpg','2012-03-12',7.2,0),(18459,'Pearl Harbor','en','The lifelong friendship between Rafe McCawley and Danny Walker is put to the ultimate test when the two ace fighter pilots become entangled in a love triangle with beautiful Naval nurse Evelyn Johnson. But the rivalry between the friends-turned-foes is immediately put on hold when they find themselves at the center of Japan\'s devastating attack on Pearl Harbor on Dec. 7, 1941.','https://image.tmdb.org/t/p/w500/y8A0Cvp8WQmZ3bjbnsL53lY0dsC.jpg','2001-05-21',6.9,0),(18460,'Winnie-the-Pooh 2','en','Sequel to Winnie-the-Pooh: Blood and Honey. Plot TBA.','https://image.tmdb.org/t/p/w500/AkgWRAbEEseJV6Csxjtut2OMahn.jpg','0000-00-00',0,0),(18461,'No Country for Old Men','en','Llewelyn Moss stumbles upon dead bodies, $2 million and a hoard of heroin in a Texas desert, but methodical killer Anton Chigurh comes looking for it, with local sheriff Ed Tom Bell hot on his trail. The roles of prey and predator blur as the violent pursuit of money and justice collide.','https://image.tmdb.org/t/p/w500/bj1v6YKF8yHqA489VFfnQvOJpnc.jpg','2007-06-13',7.9,0),(18462,'Asterix & Obelix: Mission Cleopatra','fr','The Egyptian Queen Cleopatra bets against the Roman Emperor, Julius Caesar, that her people are still great, even if the times of the Pharaohs has long passed. She vows (against all logic) to build a new palace for Caesar within three months. Since all her architects are either busy otherwise or too conservative in style, this ambivalent honor falls to Edifis. He is to build the palace and be covered in gold or, if not, his fate is to be eaten by crocodiles. Edifis calls upon an old friend to help him out: The fabulous Druid Getafix from Gaul, who brews a fantastic potion that gives supernatural strength. In order to help and protect the old Druid, Asterix and Obelix accompany him on his journey to Egypt. When Julius Caesar gets wind of the project succeeding, he has the building site attacked by his troops in order to win the bet and not lose face. But just like the local pirates, he hasn\'t counted on Asterix and Obelix.','https://image.tmdb.org/t/p/w500/sDrF8Z2GaRQjYzDuusEABohmMir.jpg','2002-01-30',7.4,0),(18463,'Dawn of the Dead','en','A group of survivors take refuge in a shopping mall after the world is taken over by aggressive, flesh-eating zombies.','https://image.tmdb.org/t/p/w500/ttquyxStEEctzghtA2f4PUGprDr.jpg','2004-03-19',7,0),(18464,'Woody Woodpecker','en','Woody Woodpecker enters a turf war with a big city lawyer wanting to tear down his home in an effort to build a house to flip.','https://image.tmdb.org/t/p/w500/vFGUsJTa8z0OfDTbjdyppAireeB.jpg','2017-10-05',6.7,0),(18465,'The Lion Guard: Return of the Roar','en','Set in the African savannah, the film follows Kion as he assembles the members of the \'Lion Guard\'. Throughout the film, the diverse team of young animals will learn how to utilize each of their unique abilities to solve problems and accomplish tasks to maintain balance within the Circle of Life, while also introducing viewers to the vast array of animals that populate the prodigious African landscape.','https: