y doctor who sets up a seemingly perfect arrangement when she offers her best friend Adam a relationship with one rule: No strings attached. But when a fling becomes a thing, can sex friends stay best friends?','https://image.tmdb.org/t/p/w500/9C09L1U9S13J4Ut029Qhu0oLcTQ.jpg','2011-01-21',6.3,0),(18473,'Joseph','en','The Biblical story of Joseph, who was sold to slavery by his brothers who were jealous of his prophetic abilities to analyze dreams and of his being their fathers\' favorite.','https://image.tmdb.org/t/p/w500/lBscKQzEJY1XF2ReZT2vIGrMQ1k.jpg','1995-04-16',8.2,0),(18474,'Magic Mike','en','Mike, an experienced stripper, takes a younger performer called The Kid under his wing and schools him in the arts of partying, picking up women, and making easy money.','https://image.tmdb.org/t/p/w500/bx6WzNMbsXMnVVGz4BV9ULPI7dK.jpg','2012-06-28',6.1,0),(18475,'National Lampoon\'s Vacation','en','Clark Griswold is on a quest to take his family on a quest to Walley World theme park for a vacation, but things don\'t go exactly as planned.','https://image.tmdb.org/t/p/w500/q3DvoqY06yZnRp9faH6uge7n7VP.jpg','1983-07-28',7.1,0),(18476,'Little Man','en','After leaving the prison, the dwarf criminal Calvin Sims joins to his moron brother Percy to steal an expensive huge diamond in a jewelry for the mobster Walken. They are chased by the police, and Calvin hides the stone in the purse of the executive Vanessa Edwards, whose husband Darryl Edwards wants to have a baby. Percy convinces Calvin to dress like a baby and be left in front of the Edwards\'s house to get inside the house and retrieve the diamond. Darryl and Vanessa keep Calvin for the weekend and decide to adopt him, while Walken threatens Darryl to get the stone back.','https://image.tmdb.org/t/p/w500/zlmlkLVNexUciv3ffdtqHELEVgg.jpg','2006-08-31',5.9,0),(18477,'Something from Tiffany\'s','en','Doesn\'t every girl dream of getting... something from Tiffany\'s? On 5th Avenue in New York City, where nothing compares to th