anksgiving, and Christmas, Gotham City\'s young vigilante known as the Batman sets out to pursue the mysterious serial killer alongside police officer James Gordon and district attorney Harvey Dent.','https://image.tmdb.org/t/p/w500/fvaB0jrzFXq07bUpox03k6qOAJu.jpg','2021-06-21',7.5,0),(18681,'Independence Day','en','On July 2, a giant alien mothership enters orbit around Earth and deploys several dozen saucer-shaped \'destroyer\' spacecraft that quickly lay waste to major cities around the planet. On July 3, the United States conducts a coordinated counterattack that fails. On July 4, a plan is devised to gain access to the interior of the alien mothership in space, in order to plant a nuclear missile.','https://image.tmdb.org/t/p/w500/p0BPQGSPoSa8Ml0DAf2mB2kCU0R.jpg','1996-06-25',6.9,0),(18682,'American Assassin','en','Following the murder of his fiancée, Mitch Rapp trains under the instruction of Cold War veteran Stan Hurley. The pair then is enlisted to investigate a wave of apparently random attacks on military and civilian targets.','https://image.tmdb.org/t/p/w500/w6vjeHx3UEaBXIyc8VFqyZYKznD.jpg','2017-09-14',6.4,0),(18683,'Smurfs: The Lost Village','en','In this fully animated, all-new take on the Smurfs, a mysterious map sets Smurfette and her friends Brainy, Clumsy and Hefty on an exciting race through the Forbidden Forest leading to the discovery of the biggest secret in Smurf history.','https://image.tmdb.org/t/p/w500/swt9crREg1UcKgg3wGWfoFNlXOz.jpg','2017-03-23',6.3,0),(18684,'8 Mile','en','For Jimmy Smith, Jr., life is a daily fight just to keep hope alive. Feeding his dreams in Detroit\'s vibrant music scene, Jimmy wages an extraordinary personal struggle to find his own voice - and earn a place in a world where rhymes rule, legends are born and every moment… is another chance.','https://image.tmdb.org/t/p/w500/7BmQj8qE1FLuLTf7Xjf9sdIHzoa.jpg','2002-11-08',7.1,0),(18685,'The Weekend Away','en','When her best friend vanishes during a girls\' trip to Croatia, Beth races to figure out what happened. But each clue yields another unsettling deception.','https://image.tmdb.org/t/p/w500/6MS0QEl7UK2gdFFbHfNwuYlsq4H.jpg','2022-03-03',6,0),(18686,'Kick-Ass 2','en','After Kick-Ass’ insane bravery inspires a new wave of self-made masked crusaders, he joins a patrol led by the Colonel Stars and Stripes. When these amateur superheroes are hunted down by Red Mist — reborn as The Mother Fucker — only the blade-wielding Hit-Girl can prevent their annihilation.','https://image.tmdb.org/t/p/w500/4LUzG0blTn6JMhUwXSmjPqNFNXL.jpg','2013-07-17',6.4,0),(18687,'Dangerous','en','A reformed sociopath heads to a remote island after the death of his brother. Soon after his arrival, the island falls under siege from a deadly gang of mercenaries, and when he discovers their role in his brother’s demise, he sets out on a relentless quest for vengeance.','https://image.tmdb.org/t/p/w500/vTtkQGC7qKlSRQJZYtAWAmYdH0A.jpg','2021-11-05',6.2,0),(18688,'I Am Dragon','ru','In the midst of the wedding princess Miroslava is kidnapped by a dragon and carried away into his castle on the remote island. Mira left everything behind in the past - family, friends and groom. Now the only things she had were a stone cage and a mysterious young man named Arman ... but who is he and what is he doing on that island? Miroslava will know the truth too late: loving a dragon will reveal the bitter truth - love is scary.','https://image.tmdb.org/t/p/w500/hbrsGRFwlnpy86GJTz5PgcvAGdO.jpg','2015-12-03',7.2,0),(18689,'The Texas Chainsaw Massacre: The Beginning','en','Chrissie and her friends set out on a road trip for a final fling before one is shipped off to Vietnam. Along the way, bikers harass the foursome and cause an accident that throws Chrissie from the vehicle. The lawman who arrives on the scene kills one of the bikers and brings Chrissie\'s friends to the Hewitt homestead, where young Leatherface is learning the tools of terror.','https://image.tmdb.org/t/p/w500/2S0XKVZGZUnsF4DjLOyZ0C63bWO.jpg','2006-10-05',6.1,0),(18690,'The Transporter','en','Former Special Forces officer, Frank Martin will deliver anything to anyone for the right price, and his no-questions-asked policy puts him in high demand. But when he realizes his latest cargo is alive, it sets in motion a dangerous chain of events. The bound and gagged Lai is being smuggled to France by a shady American businessman, and Frank works to save her as his own illegal activities are uncovered by a French detective.','https://image.tmdb.org/t/p/w500/v3QIFUWgtVN4wejVuDZowuyJ20W.jpg','2002-10-02',6.7,0),(18691,'Hitman\'s Wife\'s Bodyguard','en','The world’s most lethal odd couple – bodyguard Michael Bryce and hitman Darius Kincaid – are back on another life-threatening mission. Still unlicensed and under scrutiny, Bryce is forced into action by Darius\'s even more volatile wife, the infamous international con artist Sonia Kincaid. As Bryce is driven over the edge by his two most dangerous protectees, the trio get in over their heads in a global plot and soon find that they are all that stand between Europe and a vengeful and powerful madman.','https://image.tmdb.org/t/p/w500/PEYEqXtBjL55QDpTYMRityWnPX.jpg','2021-06-14',6.7,0),(18692,'Secret Society of Second Born Royals','en','Sam is a teenage royal rebel, second in line to the throne of the kingdom of Illyria. Just as her disinterest in the royal way of life is at an all-time high, she discovers she has super-human abilities and is invited to join a secret society of similar extraordinary second-born royals charged with keeping the world safe.','https://image.tmdb.org/t/p/w500/xOmGTJtBgRVSAF4S5dZEUqHqyy5.jpg','2020-09-25',6.8,0),(18693,'Reservoir Dogs','en','A botched robbery indicates a police informant, and the pressure mounts in the aftermath at a warehouse. Crime begets violence as the survivors -- veteran Mr. White, newcomer Mr. Orange, psychopathic parolee Mr. Blonde, bickering weasel Mr. Pink and Nice Guy Eddie -- unravel.','https://image.tmdb.org/t/p/w500/xi8Iu6qyTfyZVDVy60raIOYJJmk.jpg','1992-09-02',8.1,0),(18694,'The Perfect Dinner','it','Based on a story by Stefano Sardo, The Perfect Dinner follows Carmine (Salvatore Esposito, Gomorrah series), a Neapolitan mafioso who isn’t cut out for the criminal life. Under the protection of his boss Pasquale (Gianfranco Gallo), Carmine is sent north to run a money laundering operation through a restaurant. He simply needs to defrost frozen meals, issue receipts and dinner is served.  But everything changes when he meets Consuelo (Greta Scarano), a chef who always pursues perfection and dreams of winning a Michelin star. Carmine hires her and decides to transform the establishment into a high-end restaurant. Could the love for food and dream of winning a Michelin star give them both a second chance?','https://image.tmdb.org/t/p/w500/neTgFAKHUWnbWu5cEjnrNNzFBZN.jpg','2022-04-26',6.8,0),(18695,'Nacho Libre','en','Nacho Libre is loosely based on the story of Fray Tormenta (\"Friar Storm\"), aka Rev. Sergio Gutierrez Benitez, a real-life Mexican Catholic priest who had a 23-year career as a masked luchador. He competed in order to support the orphanage he directed.','https://image.tmdb.org/t/p/w500/kh7B91bMl2lZ0mH9WhPfaNUIEQH.jpg','2006-06-16',6.3,0),(18696,'Poseidon','en','A packed cruise ship traveling the Atlantic is hit and overturned by a massive wave, compelling the passengers to begin a dramatic fight for their lives.','https://image.tmdb.org/t/p/w500/cCx2Ead8KoZhHofsAAr7tyrjfDo.jpg','2006-05-10',5.8,0),(18697,'Seventh Son','en','John Gregory, who is a seventh son of a seventh son and also the local spook, has protected the country from witches, boggarts, ghouls and all manner of things that go bump in the night. However John is not young anymore, and has been seeking an apprentice to carry on his trade. Most have failed to survive. The last hope is a young farmer\'s son named Thomas Ward. Will he survive the training to become the spook that so many others couldn\'t?','https://image.tmdb.org/t/p/w500/7Q8DfXSjcFSSQDOxz1Sk865wNqI.jpg','2014-12-12',5.5,0),(18698,'Snow White and the Huntsman','en','After the Evil Queen marries the King, she performs a violent coup in which the King is murdered and his daughter, Snow White, is taken captive. Almost a decade later, a grown Snow White is still in the clutches of the Queen. In order to obtain immortality, The Evil Queen needs the heart of Snow White. After Snow escapes the castle, the Queen sends the Huntsman to find her in the Dark Forest.','https://image.tmdb.org/t/p/w500/8yKdQHaqOo1lkaErmqMuYFespYI.jpg','2012-05-30',6,0),(18699,'One Day','en','A romantic comedy centered on Dexter and Emma, who first meet during their graduation in 1988 and proceed to keep in touch regularly. The film follows what they do on July 15 annually, usually doing something together.','https://image.tmdb.org/t/p/w500/xGclxjTTbOdR18zqoldGTjfzSkl.jpg','2011-03-02',7.4,0),(18700,'Chip and Potato: Chip\'s Holiday','en','When falling coconuts keep everyone awake all night on vacation, Chip and Potato come up with a plan to help the family get a puggy good night\'s sleep!','https://image.tmdb.org/t/p/w500/iDN3jf36vSfGnYu0YnsdaEpNAoU.jpg','2022-06-27',5.3,0),(18701,'Dumb and Dumber','en','Lloyd and Harry are two men whose stupidity is really indescribable. When Mary, a beautiful woman, loses an important suitcase with money before she leaves for Aspen, the two friends (who have found the suitcase) decide to return it to her. After some \"adventures\" they finally get to Aspen where, using the lost money they live it up and fight for Mary\'s heart.','https://image.tmdb.org/t/p/w500/4LdpBXiCyGKkR8FGHgjKlphrfUc.jpg','1994-12-16',6.6,0),(18702,'Play Catch','cn','Billionaire Law and his accomplices are conspiring the murder of a judge. The conspiracy is overheard by a inspector from ICAC who records the meeting on a cassette tape. Billionaire Law is determined to pin him down. Before he dies, he hides the tape in a reporter Mel\'s car. A young man, Law Kim Long, smuggles into Hong Kong to look for his father. The Snake-head is mistaken him to be Billionaire Law\'s son, so he makes him groomed.','https://image.tmdb.org/t/p/w500/ujfdsD6avEJ607Xwq0gQaRN7nbc.jpg','1983-06-09',9,0),(18703,'The Empire Strikes Back','en','The epic saga continues as Luke Skywalker, in hopes of defeating the evil Galactic Empire, learns the ways of the Jedi from aging master Yoda. But Darth Vader is more determined than ever to capture Luke. Meanwhile, rebel leader Princess Leia, cocky Han Solo, Chewbacca, and droids C-3PO and R2-D2 are thrown into various stages of capture, betrayal and despair.','https://image.tmdb.org/t/p/w500/2l05cFWJacyIsTpsqSgH0wQXe4V.jpg','1980-05-20',8.4,0),(18704,'Ong Bak 2','th','Moments from death a young man is rescued by a renowned warrior. Realizing unsurpassed physical potential in the young boy he trains him into the most dangerous man alive. As he becomes a young man he goes on a lone mission of vengeance against the vicious slave traders who enslaved him as a youth and the treacherous warlord who killed his father.','https://image.tmdb.org/t/p/w500/sGyB8kVPQsofyQV1T0jE2d6k4q4.jpg','2008-12-04',6.4,0),(18705,'Step Up 2: The Streets','en','When rebellious street dancer Andie lands at the elite Maryland School of the Arts, she finds herself fighting to fit in while also trying to hold onto her old life. When she joins forces with the schools hottest dancer, Chase, to form a crew of classmate outcasts to compete in Baltimore s underground dance battle The Streets.','https://image.tmdb.org/t/p/w500/yfpiv2fqwOmMPwx2RvbSxN9hBhd.jpg','2008-02-14',6.7,0),(18706,'The Experiment','en','20 men are chosen to participate in the roles of guards and prisoners in a psychological study that ultimately spirals out of control.','https://image.tmdb.org/t/p/w500/zy6hJYii2PJfMRoUBlULhfuLsgL.jpg','2010-07-15',6.4,0),(18707,'Dinosaur Hotel','en','Sienna is desperate to win a large cash prize in a secret underground game show. However, Dinosaur\'s begin to hunt her down for the entertainment of the rich and wealthy. Can she be the last to survive the horrific night to win the prize?','https://image.tmdb.org/t/p/w500/qISzj26R3LnsChQcXQKnuyxQQhK.jpg','2021-06-11',5.3,0),(18708,'Superman','en','Mild-mannered Clark Kent works as a reporter at the Daily Planet alongside his crush, Lois Lane. Clark must summon his superhero alter-ego when the nefarious Lex Luthor launches a plan to take over the world.','https://image.tmdb.org/t/p/w500/d7px1FQxW4tngdACVRsCSaZq0Xl.jpg','1978-12-13',7.1,0),(18709,'Step Up Revolution','en','Emily arrives in Miami with aspirations to become a professional dancer. She sparks with Sean, the leader of a dance crew whose neighborhood is threatened by Emily\'s father\'s development plans.','https://image.tmdb.org/t/p/w500/ab9T58BlOPauWd9tMnK0HhwYY7u.jpg','2012-07-26',6.9,0),(18710,'Mortal Kombat Legends: Scorpion\'s Revenge','en','After the vicious slaughter of his family by stone-cold mercenary Sub-Zero, Hanzo Hasashi is exiled to the torturous Netherrealm. There, in exchange for his servitude to the sinister Quan Chi, he’s given a chance to avenge his family – and is resurrected as Scorpion, a lost soul bent on revenge. Back on Earthrealm, Lord Raiden gathers a team of elite warriors – Shaolin monk Liu Kang, Special Forces officer Sonya Blade and action star Johnny Cage – an unlikely band of heroes with one chance to save humanity. To do this, they must defeat Shang Tsung’s horde of Outworld gladiators and reign over the Mortal Kombat tournament.','https://image.tmdb.org/t/p/w500/4VlXER3FImHeFuUjBShFamhIp9M.jpg','2020-04-12',8.2,0),(18711,'The Transporter Refueled','en','The fast-paced action movie is again set in the criminal underworld in France, where Frank Martin is known as The Transporter, because he is the best driver and mercenary money can buy. In this installment, he meets Anna and they attempt to take down a group of ruthless Russian human traffickers who also have kidnapped Frank’s father.','https://image.tmdb.org/t/p/w500/71kaQfdrMy0LHSeLRADsvlDGCgb.jpg','2015-09-02',5.5,0),(18712,'The Little Things','en','Deputy Sheriff Joe \"Deke\" Deacon joins forces with Sgt. Jim Baxter to search for a serial killer who\'s terrorizing Los Angeles. As they track the culprit, Baxter is unaware that the investigation is dredging up echoes of Deke\'s past, uncovering disturbing secrets that could threaten more than his case.','https://image.tmdb.org/t/p/w500/tLO1aD1ghdtVMT32z2sRmzgYKYd.jpg','2021-01-28',6.3,0),(18713,'District 9','en','Thirty years ago, aliens arrive on Earth. Not to conquer or give aid, but to find refuge from their dying planet. Separated from humans in a South African area called District 9, the aliens are managed by Multi-National United, which is unconcerned with the aliens\' welfare but will do anything to master their advanced technology. When a company field agent contracts a mysterious virus that begins to alter his DNA, there is only one place he can hide: District 9.','https://image.tmdb.org/t/p/w500/tuGlQkqLxnodDSk6mp5c2wvxUEd.jpg','2009-08-05',7.4,0),(18714,'Jackass Forever','en','Celebrate the joy of a perfectly executed shot to the groin as Johnny Knoxville, Steve-O and the rest of the gang return alongside some newcomers for one final round of hilarious, wildly absurd and often dangerous displays of stunts and comedy.','https://image.tmdb.org/t/p/w500/ugIdyvtAzHWOguD91UjHKoAvfum.jpg','2022-02-01',6.9,0),(18715,'The Craft','en','A Catholic school newcomer falls in with a clique of teen witches who wield their powers against all who dare to cross them -- be they teachers, rivals or meddlesome parents.','https://image.tmdb.org/t/p/w500/nQsPOhIEHQ06I9SZDIzAU9sdvdr.jpg','1996-05-03',6.7,0),(18716,'Blue Lagoon: The Awakening','en','Two high school students become stranded on a tropical island and must rely on each other for survival. They learn more about themselves and each other while falling in love.','https://image.tmdb.org/t/p/w500/ptsBY9Aqo4Mn0V1krI5s8WfFxzW.jpg','2012-06-16',6.5,0),(18717,'The Key','it','Art professor Nino Rolfe attempts to break down his wife Teresa\'s conventional modesty. Noticing her affection for their daughter\'s fiancé, Nino instigates her sexual interest in him - setting off a chain of unexpected events and emotional complications...','https://image.tmdb.org/t/p/w500/kWkiYLxHjFaa68DgH4GfkanC5yi.jpg','1983-10-19',5.9,0),(18718,'Sinister','en','True-crime writer Ellison Oswald is in a slump; he hasn\'t had a best seller in more than 10 years and is becoming increasingly desperate for a hit. So, when he discovers the existence of a snuff film showing the deaths of a family, he vows to solve the mystery. He moves his own family into the victims\' home and gets to work. However, when old film footage and other clues hint at the presence of a supernatural force, Ellison learns that living in the house may be fatal.','https://image.tmdb.org/t/p/w500/8bc2p3DjWfQjxSZJuQ1BCi6K1tm.jpg','2012-03-29',6.9,0),(18719,'Sherlock Holmes: A Game of Shadows','en','There is a new criminal mastermind at large (Professor Moriarty) and not only is he Holmes’ intellectual equal, but his capacity for evil and lack of conscience may give him an advantage over the  detective.','https://image.tmdb.org/t/p/w500/vskIKrMNUAhns05dx8WYBQfcJEs.jpg','2011-11-22',7.1,0),(18720,'How I Became a Superhero','fr','Paris 2020. While superheroes have assimilated into the Parisian society, they discover a new drug that gives themselves personal superpowers to mere mortals. Lieutenants Moreau and Schaltzmann are investigating the case with the support of two ex-superheroes, Monte Carlo and Callista. They\'ll do whatever it takes to dismantle the traffic. But Moreau\'s past resurfaces, and the investigation becomes more complicated.','https://image.tmdb.org/t/p/w500/d0wn9YtEnmbucx8ZUsT918ctoiK.jpg','2020-11-19',6.2,0),