d Hands: The Ben Carson Story','en','Gifted Hands: The Ben Carson Story is a movie based on the life story of world-renowned neurosurgeon Ben Carson from 1961 to 1987.','https://image.tmdb.org/t/p/w500/4NxxtiqezjUmUxoDTOjO5FeJvFt.jpg','2009-02-07',7.8,0),(18728,'Predestination','en','Predestination chronicles the life of a Temporal Agent sent on an intricate series of time-travel journeys designed to prevent future killers from committing their crimes. Now, on his final assignment, the Agent must stop the one criminal that has eluded him throughout time and prevent a devastating attack in which thousands of lives will be lost.','https://image.tmdb.org/t/p/w500/sYjpJZEdwELjdHy4OVzazeJVT0z.jpg','2014-08-28',7.4,0),(18729,'Weird: The Al Yankovic Story','en','Exploring every facet of ‘Weird Al’ Yankovic’s life, from his meteoric rise to fame with early hits like ‘Eat It’ and ‘Like a Surgeon’ to his torrid celebrity love affairs and famously depraved lifestyle, this biopic takes audiences on a truly unbelievable journey through Yankovic’s life and career, from gifted child prodigy to the greatest musical legend of all time.','https://image.tmdb.org/t/p/w500/qcj2z13G0KjaIgc01ifiUKu7W07.jpg','2022-09-08',6.9,0),(18730,'Sucker Punch','en','A young girl is institutionalized by her abusive stepfather. Retreating to an alternative reality as a coping strategy, she envisions a plan which will help her escape from the mental facility.','https://image.tmdb.org/t/p/w500/8oBc33JEnYm3rqPIwGtQXQbP96j.jpg','2011-03-24',6.2,0),(18731,'The Grey','en','Following a grueling five-week shift at an Alaskan oil refinery, workers led by sharpshooter John Ottway, are flying home for a much-needed vacation. But a brutal storm causes their plane to crash in the frozen wilderness, and only eight men, including Ottway, survive. As they trek southward toward civilization and safety, Ottway and his companions must battle mortal injuries, the icy elements, and a pack of hungry wolves.','https://image.tmdb.org/t/p/w500/a0Vt3wx8ciKmPt4iXPx9sH4HBVU.jpg','2012-01-26',6.6,0),(18732,'The Banishing','en','In the 1930s, a young reverend and his family are forced to confront their worst fears when they discover their new home holds a horrifying secret.','https://image.tmdb.org/t/p/w500/wBvubEmOBRwA0HolPanqjMaMjfk.jpg','2021-04-29',5.3,0),(18733,'No Escape','en','In their new overseas home, an American family soon finds themselves caught in the middle of a coup, and they frantically look for a safe escape in an environment where foreigners are being immediately executed.','https://image.tmdb.org/t/p/w500/6WLnzTG4Hz3lFvfZGSsyB8NFGgM.jpg','2015-08-26',6.9,0),(18734,'To All the Boys I\'ve Loved Before','en','Lara Jean\'s love life goes from imaginary to out of control when her secret letters to every boy she\'s ever fallen for are mysteriously mailed out.','https://image.tmdb.org/t/p/w500/hKHZhUbIyUAjcSrqJThFGYIR6kI.jpg','2018-08-16',7.7,0),(18735,'Kingdom of Heaven','en','After his wife dies, a blacksmith named Balian is thrust into royalty, political intrigue and bloody holy wars during the Crusades.','https://image.tmdb.org/t/p/w500/uk55nBEFIQFveIiy9jvLGiVtk4h.jpg','2005-05-03',6.9,0),(18736,'Robots','en','Rodney Copperbottom is a young robot inventor who dreams of making the world a better place, until the evil Ratchet takes over Big Weld Industries. Now, Rodney\'s dreams – and those of his friends – are in danger of becoming obsolete.','https://image.tmdb.org/t/p/w500/bS94Dt0FKW1463UQyv78MVOw6Pf.jpg','2005-03-10',6.4,0),(18737,'The People We Hate at the Wedding','en','A dysfunctional family that can\'t seem to get along and get it together reluctantly reunites for a family wedding. As their many skeletons are wrenched from the closet, it turns out to be just what this singular family needs to reconnect.','https://image.tmdb.org/t/p/w500/kQZKw9jetOInPPdSZgbKFxJALHc.jpg','2022-11-17',6.2,0),(18738,'PAW Patrol: Mighty Pups','en','When their latest scheme goes awry, Mayor Humdinger and his nephew Harold accidentally divert a meteor towards Adventure Bay. The meteor\'s golden energy grants the PAW Patrol superpowers. The heroic Mighty Pups are on a roll to super-save the day.','https://image.tmdb.org/t/p/w500/h09VT8gNfRBlr7S8l1lm27m4rus.jpg','2018-10-04',7.5,0),(18739,'Evil Dead II','en','Ash Williams and his girlfriend Linda find a log cabin in the woods with a voice recording from an archeologist who had recorded himself reciting ancient chants from \"The Book of the Dead.\" As they play the recording an evil power is unleashed taking over Linda\'s body.','https://image.tmdb.org/t/p/w500/xRixTGkED0TTc1vgfMOuwyWxKO5.jpg','1987-03-13',7.6,0),(18740,'National Treasure','en','Modern treasure hunters, led by archaeologist Ben Gates, search for a chest of riches rumored to have been stashed away by George Washington, Thomas Jefferson and Benjamin Franklin during the Revolutionary War. The chest\'s whereabouts may lie in secret clues embedded in the Constitution and the Declaration of Independence, and Gates is in a race to find the gold before his enemies do.','https://image.tmdb.org/t/p/w500/pxL6E4GBOPUG6CdkO9cUQN5VMwI.jpg','2004-11-19',6.6,0),(18741,'Pet Sematary','en','Dr. Louis Creed and his wife, Rachel, move from Boston to Ludlow, in rural Maine, with their two young children. Hidden in the woods near the new family home, Ellie, their eldest daughter, discovers a mysterious cemetery where the pets of community members are buried.','https://image.tmdb.org/t/p/w500/7SPhr7Qj39vbnfF9O2qHRYaKHAL.jpg','2019-04-04',5.7,0),(18742,'Prison Break: The Final Break','en','The movie covers the events which occurred in between the downfall of The Company and the finale of the TV series (SEASON 4). It details the arrest and incarceration of Sara Tancredi, the final escape plan which Michael devises for Sara, and reveals the ultimate fate of Gretchen Morgan.','https://image.tmdb.org/t/p/w500/wysK4kBW1u4VSXDfSbgODVC6Mst.jpg','2009-05-24',7.5,0),(18743,'Trust Me U Die','cn','In England, Dr. Greg Fong invents a super steroid (SS160) which can cure virtually all illnesses and disorders (including impotence and idiocy) and generally makes someone superhuman. But his obsession with the super drug, begins making him mentally unbalanced. After the death of his co-worker, Fong returns to Hong Kong with his new wonder drug and begins working with old friend Dr. Mike Chow (Mark Cheng) Mike (who sells black market kidneys) then drugs and rapes his Fong\'s girlfriend Vivian who falls for him in return (!). Fong takes the affair as good reason to do a bit of human medical tests, and begins doing secret medical experiments on Dr. Chow, as well as a host of other patients, notably including policeman Chan Sum who begins turning superhuman.','https://image.tmdb.org/t/p/w500/vUNW3fNzLkzjrCuFrJrqjufmLcl.jpg','1998-01-21',3.5,0),(18744,'Meg 2: The Trench','en','','https://image.tmdb.org/t/p/w500/umYbu5PWSi0rQjUXUQCBwNmJyAS.jpg','2023-08-02',0,0),(18745,'Phineas and Ferb: The Movie: Candace Against the Universe','en','Phineas and Ferb travel across the galaxy to rescue their older sister Candace, who has been abducted by aliens and taken to a utopia in a far-off planet, free of her pesky little brothers.','https://image.tmdb.org/t/p/w500/n6hptKS7Y0ZjkYwbqKOK3jz9XAC.jpg','2020-08-28',7.3,0),(18746,'Lockout','en','Set in the near future, Lockout follows a falsely convicted ex-government agent , whose one chance at obtaining freedom lies in the dangerous mission of rescuing the President\'s daughter from rioting convicts at an outer space maximum security prison.','https://image.tmdb.org/t/p/w500/i5QfNIcg6hc327IWUerea0EczP4.jpg','2012-04-12',5.9,0),(18747,'A Million Ways to Die in the West','en','As a cowardly farmer begins to fall for the mysterious new woman in town, he must put his new-found courage to the test when her husband, a notorious gun-slinger, announces his arrival.','https://image.tmdb.org/t/p/w500/n9SicwnoNGWBwE75le27sUhCLMm.jpg','2014-05-22',6,0),(18748,'Die Hard 2','en','Off-duty cop John McClane is gripped with a feeling of déjà vu when, on a snowy Christmas Eve in the nation’s capital, terrorists seize a major international airport, holding thousands of holiday travelers hostage. Renegade military commandos led by a murderous rogue officer plot to rescue a drug lord from justice and are prepared for every contingency except one: McClane’s smart-mouthed heroics.','https://image.tmdb.org/t/p/w500/56QECFJxueUVJAppVxwEE9ZDYrn.jpg','1990-07-02',6.9,0),(18749,'Rocky II','en','After Rocky goes the distance with champ Apollo Creed, both try to put the fight behind them and move on. Rocky settles down with Adrian but can\'t put his life together outside the ring, while Creed seeks a rematch to restore his reputation. Soon enough, the \"Master of Disaster\" and the \"Italian Stallion\" are set on a collision course for a climactic battle that is brutal and unforgettable.','https://image.tmdb.org/t/p/w500/t2WuqQ0Jbyaql1WXNFx9dr6Ldpt.jpg','1979-06-15',7.2,0),(18750,'Mrs. Harris Goes to Paris','en','A 1950s London cleaning lady falls in love with an haute couture dress by Christian Dior and decides to gamble everything for the sake of this folly.','https://image.tmdb.org/t/p/w500/2SV7RYEqiPr3LpTaI33eUtYn09c.jpg','2022-07-15',7.4,0),(18751,'Insidious: Fear the Dark','en','Ten years after he first ventured into the Further, Josh Lambert heads east to drop his son Dalton off at an idyllic, ivy-covered university. However, Dalton\'s college dream becomes a nightmare when the repressed demons of his past suddenly resurface.','https://image.tmdb.org/t/p/w500/6RM6iBv730BruwIbSBzxr2T9QAk.jpg','2023-07-05',0,0),(18752,'Rogue One: A Star Wars Story','en','A rogue band of resistance fighters unite for a mission to steal the Death Star plans and bring a new hope to the galaxy.','https://image.tmdb.org/t/p/w500/i0yw1mFbB7sNGHCs7EXZPzFkdA1.jpg','2016-12-14',7.5,0),(18753,'Rock Dog 2: Rock Around the Park','en','When Bodi and his band \'True Blue\' leave Snow Mountain, to tour with pop sensation, Lil\' Foxy, they learn that fame comes at a price.','https://image.tmdb.org/t/p/w500/kETYRGA15L0wkVPugSl8lKmSgFn.jpg','2021-08-05',6.7,0),(18754,'Transporter 3','en','Frank Martin puts the driving gloves on to deliver Valentina, the kidnapped daughter of a Ukranian government official, from Marseilles to Odessa on the Black Sea. En route, he has to contend with thugs who want to intercept Valentina\'s safe delivery and not let his personal feelings get in the way of his dangerous objective.','https://image.tmdb.org/t/p/w500/ngpLhUccj6mlvAVpiIa7jUcFxhT.jpg','2008-11-26',6.1,0),(18755,'Minions','en','Minions Stuart, Kevin and Bob are recruited by Scarlet Overkill, a super-villain who, alongside her inventor husband Herb, hatches a plot to take over the world.','https://image.tmdb.org/t/p/w500/vlOgaxUiMOA8sPDG9n3VhQabnEi.jpg','2015-06-17',6.4,0),(18756,'Mr. & Mrs. Smith','en','After five (or six) years of vanilla-wedded bliss, ordinary suburbanites John and Jane Smith are stuck in a huge rut. Unbeknownst to each other, they are both coolly lethal, highly-paid assassins working for rival organisations. When they discover they\'re each other\'s next target, their secret lives collide in a spicy, explosive mix of wicked comedy, pent-up passion, nonstop action and high-tech weaponry.','https://image.tmdb.org/t/p/w500/wzIO3ytxeSNt1wRpXLIdkNbGoDm.jpg','2005-06-07',6.7,0),(18757,'Four\'s a Crowd','es','Julián, a divorced man with financial problems, uses a cell phone application to share his car with strangers.','https://image.tmdb.org/t/p/w500/deOu3LDIbWtipp8vjCaszKz22LZ.jpg','2022-10-28',6.9,0),(18758,'Good Luck to You, Leo Grande','en','Nancy Stokes doesn’t know good sex. Whatever it may be, Nancy, a retired schoolteacher, is pretty sure she has never had it, but she is determined to finally do something about that. She even has a plan: It involves an anonymous hotel room, and a 