 to the spirit world.','https://image.tmdb.org/t/p/w500/chnxUtTmTRZh5FE7Ha4aUOZ9ahs.jpg','2013-09-12',6.7,0),(18764,'Rings','en','Julia becomes worried about her boyfriend Holt when he explores the dark urban legend of a mysterious videotape said to kill the watcher seven days after viewing. She sacrifices herself to save her boyfriend and in doing so makes a horrifying discovery: there is a \"movie within the movie\" that no one has ever seen before.','https://image.tmdb.org/t/p/w500/yp4CDOVpVmNwiPoZKQeFCpW8CFo.jpg','2017-02-01',5,0),(18765,'The Other Guys','en','Unlike their heroic counterparts on the force, desk-bound NYPD detectives Gamble and Hoitz garner no headlines as they work day to day. When a seemingly minor case turns out to be a big deal, the two cops get the opportunity to finally prove to their comrades that they have the right stuff.','https://image.tmdb.org/t/p/w500/wNEHNqo3MgHmj3BUiPSqqq5czcm.jpg','2010-08-06',6.3,0),(18766,'Megalodon','en','A military vessel on the search for an unidentified submersible finds themselves face to face with a giant shark, forced to use only what they have on board to defend themselves from the monstrous beast.','https://image.tmdb.org/t/p/w500/hES2eVAbVt08JJTqgu3jmI34Yxx.jpg','2018-08-10',5.6,0),(18767,'Us','en','Husband and wife Gabe and Adelaide Wilson take their kids to their beach house expecting to unplug and unwind with friends. But as night descends, their serenity turns to tension and chaos when some shocking visitors arrive uninvited.','https://image.tmdb.org/t/p/w500/ux2dU1jQ2ACIMShzB3yP93Udpzc.jpg','2019-03-14',7,0),(18768,'A Bronx Tale','en','Set in the Bronx during the tumultuous 1960s, an adolescent boy is torn between his honest, working-class father and a violent yet charismatic crime boss. Complicating matters is the youngster\'s growing attraction - forbidden in his neighborhood - for a beautiful black girl.','https://image.tmdb.org/t/p/w500/sDbO6LmLYtyqAoFTPpRcMgPSCEO.jpg','1993-09-14',7.8,0),(18769,'Anacondas: The Hunt for the Blood Orchid','en','The blood orchid - a rare flower that could hold the secret of eternal life and be worth a fortune to the company that finds it. Led by a pharmaceutical research team, a scientific expedition sets out to explore deep into the jungles of Borneo to locate and bring back samples of the legendary plant. Battling through rainstorms to make their way upriver, the group encounters poisonous insects and a ferocious crocodile, only to discover they\'re being stalked by an even greater danger: a gathering of giant anacondas! Heat-sensing, fifty-foot-long flesh-eaters that\'ll go after anyone that crosses their path!','https://image.tmdb.org/t/p/w500/gTlVy3wUApAanIAPdx3yz0YOROD.jpg','2004-08-26',5.4,0),(18770,'Truth or Dare','en','A harmless game of \"Truth or Dare\" among friends turns deadly when someone—or something—begins to punish those who tell a lie—or refuse the dare.','https://image.tmdb.org/t/p/w500/ei2waWQAG8NP244WShIFgGu9IOu.jpg','2018-04-12',6,0),(18771,'My Girl 2','en','Vada Sultenfuss has a holiday coming up, and an assignment: to do and essay on someone she admires and has never met. She decides she wants to do an assignment on her mother, but quickly realises she knows very little about her. She manages to get her father to agree to let her go to LA to stay with her Uncle Phil and do some research on her mother.','https://image.tmdb.org/t/p/w500/hEZ6L72eBORRnoUxf4pip5U76pq.jpg','1994-02-11',5.9,0),(18772,'The Old Way','en','An old gunslinger and his daughter must face the consequences of his past, when the son of a man he murdered years ago arrives to take his revenge.','https://image.tmdb.org/t/p/w500/8HCCYAIocXxMKn7J9yQfDX1vBM5.jpg','2023-01-06',6,0),(18773,'All the Bright Places','en','Two teens facing personal struggles form a powerful bond as they embark on a cathartic journey chronicling the wonders of Indiana.','https://image.tmdb.org/t/p/w500/4SafxuMKQiw4reBiWKVZJpJn80I.jpg','2020-02-28',7.7,0),(18774,'Men in Black: International','en','The Men in Black have always protected the Earth from the scum of the universe. In this new adventure, they tackle their biggest, most global threat to date: a mole in the Men in Black organization.','https://image.tmdb.org/t/p/w500/dPrUPFcgLfNbmDL8V69vcrTyEfb.jpg','2019-06-12',6,0),(18775,'The Departed','en','To take down South Boston\'s Irish Mafia, the police send in one of their own to infiltrate the underworld, not realizing the syndicate has done likewise. While an undercover cop curries favor with the mob kingpin, a career criminal rises through the police ranks. But both sides soon discover there\'s a mole among them.','https://image.tmdb.org/t/p/w500/kWWAt2FMRbqLFFy8o5R4Zr8cMAb.jpg','2006-10-04',8.2,0),(18776,'Stepmom','en','Jackie is a divorced mother of two. Isabel is the career minded girlfriend of Jackie’s ex-husband Luke, forced into the role of unwelcome stepmother to their children. But when Jackie discovers she is ill, both women realise they must put aside their differences to find a common ground and celebrate life to the fullest, while they have the chance.','https://image.tmdb.org/t/p/w500/1bBiApUkRfzislORsl07d6XXYsT.jpg','1998-12-25',7.2,0),(18777,'Wrong Turn 6: Last Resort','en','A sudden and mysterious inheritance brings Danny and his friends to Hobb Springs, a forgotten resort deep in the West Virginia hills. Hobb Springs is being looked after under the watchful care of Jackson and Sally, a socially awkward couple who introduce Danny to the long lost family he\'s never known. A clan by the name of Hillicker. But soon Danny learns his relatives have a different way of living, that for generations, the Hillickers have observed ancient traditions rooted in cannibalism and other taboo rituals.','https://image.tmdb.org/t/p/w500/cV1biK7jlHVXlQ7ErYe5MUSBGcx.jpg','2014-08-22',5.4,0),(18778,'Room in Rome','es','A hotel room in the center of Rome serves as the setting for Alba and Natasha, two young and recently acquainted women, to have a physical adventure that touches their very souls.','https://image.tmdb.org/t/p/w500/gx2ENSap1D4nbjcz7cLLAs4S3fy.jpg','2010-05-07',6.4,0),(18779,'Skinamarink','en','Two children wake up in the middle of the night to find their father is missing, and all the windows and doors in their home have vanished.','https://image.tmdb.org/t/p/w500/o942912KFh89SGhqWuKXuT0SXzN.jpg','2023-01-13',5.6,0),(18780,'Barbie in A Mermaid Tale 2','en','Surf\'s up for Barbie as she returns as Merliah, the fun and fashionable surfing champion who\'s also a magical mermaid princess! In this exciting sea-quel, Merliah makes a splash when she heads to Australia for the ultimate surfing competition. When the evil mermaid Eris escapes from her whirlpool with plans to take over the throne of Oceana, Merliah and her sea friends dive in to stop her. It\'s a fresh new adventure where Merliah learns that anything is possible and she really can have the best of both worlds!','https://image.tmdb.org/t/p/w500/iVCfTtVDAECpbMSokSNilIR6wPr.jpg','2012-02-22',7,0),(18781,'War Room','en','The family-friendly movie explores the transformational role prayer plays in the lives of the Jordan family. Tony and Elizabeth Jordan, a middle-class couple who seemingly have it all – great jobs, a beautiful daughter, their dream home. But appearances can be deceiving. In reality, the Jordan’s marriage has become a war zone and their daughter is collateral damage. With the help of Miss Clara, an older, wiser woman, Elizabeth discovers she can start fighting for her family instead of against them. Through a newly energized faith, Elizabeth and Tony’s real enemy doesn’t have a prayer.','https://image.tmdb.org/t/p/w500/unxQeVUi5DH01r7ZNvAHwpvX7UK.jpg','2015-08-28',7.8,0),(18782,'Paul','en','For the past 60 years, a space-traveling smart-ass named Paul has been locked up in a top-secret military base, advising world leaders about his kind. But when he worries he’s outlived his usefulness and the dissection table is drawing uncomfortably close, Paul escapes on the first RV that passes by his compound in Area 51. Fortunately, it contains the two earthlings who are most likely to rescue and harbor an alien on the run.','https://image.tmdb.org/t/p/w500/ijTJf6evpPF0DgGMgiUFxbDgnJh.jpg','2011-02-14',6.7,0),(18783,'The Hurricane Heist','en','Thieves attempt a massive heist against the U.S. Treasury as a Category 5 hurricane approaches one of its Mint facilities.','https://image.tmdb.org/t/p/w500/rAmcj5IZcx59dhev3UnVDEGlImK.jpg','2018-02-28',5.7,0),(18784,'Killing Gunther','en','A group of eccentric assassins are fed up with Gunther, the world\'s greatest hitman, and decide to kill him – but their plan turns into a series of bungled encounters as Gunther seems to always be one step ahead.','https://image.tmdb.org/t/p/w500/5jm2l2qRq8jEzXzOZgD2wEgFznq.jpg','2017-09-22',4.8,0),(18785,'Encounter','en','A decorated Marine goes on a rescue mission to save his two young sons from an unhuman threat. As their journey takes them in increasingly dangerous directions, the boys will need to leave their childhoods behind.','https://image.tmdb.org/t/p/w500/tUkY0WxffPZ9PoyC62PIyyUMGnt.jpg','2021-12-03',6.5,0),(18786,'Pelé','pt','Against the backdrop of a turbulent era in Brazil, this documentary captures Pelé\'s extraordinary path from breakthrough talent to national hero. Mixing rare archival footage and exclusive interviews, this documentary celebrates the legendary Brazilian footballer who personified football as art.','https://image.tmdb.org/t/p/w500/tX2gco2U4MlKEWwM4UkiIf1C74e.jpg','2021-02-23',7.5,0),(18787,'All Ladies Do It','it','Diana is a Roman wife happily married to sympathetic Paolo but she is keen on playing benign games of seduction with other men while resisting the advances of chic lingerie shop owner Silvio. She narrates her adventures to Paolo in order to stimulate their otherwise monotonous sexual life. However, under the influence of her lesbian friend Antonietta and raunchy sister Nadia, Diana starts to move the ongoings further while Paolo is still prone to believing that events narrated by her are merely fantasies.','https://image.tmdb.org/t/p/w500/6Wzhfs1udDyEAwepW5SZsSwjNhk.jpg','1992-02-21',4.6,0),(18788,'Courageous','en','Law enforcement officers Adam Mitchell, Nathan Hayes, and their partners stand up to the worst the streets have to offer with confidence and focus. Yet at the end of the day, they face a challenge that none of them are truly prepared to tackle: fatherhood. They know that God desires to turn the hearts of fathers to their children, but their children are beginning to drift further and further away from them. When tragedy hits home, these men are left wrestling with their hopes, their fears, their faith, and their fathering. Can a newfound urgency help these dads draw closer to God... and to their children?','https://image.tmdb.org/t/p/w500/CkwRzUmxvMZvkzzGE45nqLGTm8.jpg','2011-09-30',7.5,0),(18789,'Superman/Shazam!: The Return of Black Adam','en','Chosen the world’s protector against the Seven Deadly Enemies of Man – pride, envy, greed, hatred, selfishness, laziness and injustice – young Billy Batson accepts his destiny as Captain Marvel. Battling alongside Superman against nefarious Black Adam, Billy soon discovers the challenge super heroes ultimately face: is it revenge or justice?','https://image.tmdb.org/t/p/w500/3MgwChvi42N1RnhQE9A4pQVHyUY.jpg','2010-11-16',7.1,0),(18790,'Appassionata','it','Two teenage friends conspire to find out how much their youthful sensuality can disrupt one of their households, headed by a dentist and his mentally-ill wife.','https://image.tmdb.org/t/p/w500/2x2V2fenzQf2O2maVslIQVCS4gV.jpg','1974-05-22',5.9,0),(18791,'House of Gucci','en','When Patrizia Reggiani, an outsider from humble beginnings, marries into the Gucci family, her unbridled ambition begins to unravel the family legacy and triggers a reckless spiral of betrayal, decadence, revenge, and ultimately… murder.'