dess','de','Susan arrives in Haiti to live with her husband Jack, who lives with a lesbian housekeeper and Olga, a nymphomaniac platinum blonde, introduced to her as Jack\'s sister. Susan begins to have nightmares about voodoo ceremonies and murder.','https://image.tmdb.org/t/p/w500/4M1TMBzg9FZvRQkvcf8nQLSclu5.jpg','1977-12-09',4.9,0),(18801,'28 Weeks Later','en','The inhabitants of the British Isles have lost their battle against the onslaught of disease, as the deadly rage virus has killed every citizen there. Six months later, a group of Americans dare to set foot on the isles, convinced the danger has come and gone. But it soon becomes all too clear that the scourge continues to live, waiting to pounce on its next victims.','https://image.tmdb.org/t/p/w500/ja8nzgtzhJq0vtX3BJcnbceIxCF.jpg','2007-04-26',6.6,0),(18802,'Code 8','en','In Lincoln City, some inhabitants have extraordinary abilities. Most live below the poverty line, under the close surveillance of a heavily militarized police force. Connor, a construction worker with powers, involves with a criminal gang to help his ailing mother. (Based on the short film “Code 8,” 2016.)','https://image.tmdb.org/t/p/w500/izGX7npHEopDQvngYcxMJEfcFbj.jpg','2019-12-06',6.2,0),(18803,'Step Up','en','Tyler Gage receives the opportunity of a lifetime after vandalizing a performing arts school, gaining him the chance to earn a scholarship and dance with an up and coming dancer, Nora.','https://image.tmdb.org/t/p/w500/9Y2i54Etpx7JvCxj6D8P3VAH152.jpg','2006-08-11',6.9,0),(18804,'Star Wars: Episode I - The Phantom Menace','en','Anakin Skywalker, a young slave strong with the Force, is discovered on Tatooine. Meanwhile, the evil Sith have returned, enacting their plot for revenge against the Jedi.','https://image.tmdb.org/t/p/w500/6wkfovpn7Eq8dYNKaG5PY3q2oq6.jpg','1999-05-19',6.5,0),(18805,'A Nightmare on Elm Street','en','Teenagers in a small town are dropping like flies, apparently in the grip of mass hysteria causing their suicides. A cop\'s daughter, Nancy Thompson, traces the cause to child molester Fred Krueger, who was burned alive by angry parents many years before. Krueger has now come back in the dreams of his killers\' children, claiming their lives as his revenge. Nancy and her boyfriend, Glen, must devise a plan to lure the monster out of the realm of nightmares and into the real world...','https://image.tmdb.org/t/p/w500/wGTpGGRMZmyFCcrY2YoxVTIBlli.jpg','1984-11-09',7.3,0),(18806,'Paranormal Activity 3','en','In 1988, young sisters Katie and Kristi befriend an invisible entity who resides in their home.','https://image.tmdb.org/t/p/w500/9nYranPiWdNmbD5PRPPSL7VUFTS.jpg','2011-10-19',5.9,0),(18807,'The Ballad of Buster Scruggs','en','Vignettes weaving together the stories of six individuals in the old West at the end of the Civil War. Following the tales of a sharp-shooting songster, a wannabe bank robber, two weary traveling performers, a lone gold prospector, a woman traveling the West to an uncertain future, and a motley crew of strangers undertaking a carriage ride.','https://image.tmdb.org/t/p/w500/voxl654m7p36y8FLu8oQD7dfwwK.jpg','2018-11-09',7.1,0),(18808,'What\'s Love Got to Do With It?','en','Two childhood friends now in their thirties must decide whether to follow their heads or their hearts once the man decides to follow his parents\' advice and enter into an arranged marriage in Pakistan.','https://image.tmdb.org/t/p/w500/qePnzgK9UiCGPK2Hxmw0yoi6HdL.jpg','2023-01-26',4.7,0),(18809,'Nanny McPhee','en','Widower Cedric Brown hires Nanny McPhee to care for his seven rambunctious children, who have chased away all previous nannies. Taunted by Simon and his siblings, Nanny McPhee uses mystical powers to instill discipline. And when the children\'s great-aunt and benefactor, Lady Adelaide Stitch, threatens to separate the kids, the family pulls together under the guidance of Nanny McPhee.','https://image.tmdb.org/t/p/w500/j9zWPwaHDWE3K1Mb5RNahzwd3KY.jpg','2005-10-21',6.6,0