 Grave','en','After a young writer is brutally gang-raped and left for dead by four men, she systematically hunts them down one by one to exact a terrible vengeance.','https://image.tmdb.org/t/p/w500/nMCkOo26GtISoxJmpkTAJyMqBO8.jpg','1978-11-02',5.9,0),(18821,'Swim','en','A family gets trapped in their storm flooded vacation rental, tries to escape from a hungry shark that made it\'s way into the house.','https://image.tmdb.org/t/p/w500/pBSqH6avxduNAnXhyIkcAfcUMJ0.jpg','2021-08-13',6.2,0),(18822,'Eva','tl','When Eva gets involved in a steamy threesome with a houseboy and her lady boss, she realizes she has to choose only one between them.','https://image.tmdb.org/t/p/w500/bXZ3j3kQgCRZj7KD4Q5F9m5ABaQ.jpg','2021-12-24',5.6,0),(18823,'A Beautiful Mind','en','John Nash is a brilliant but asocial mathematician fighting schizophrenia. After he accepts secret work in cryptography, his life takes a turn for the nightmarish.','https://image.tmdb.org/t/p/w500/zwzWCmH72OSC9NA0ipoqw5Zjya8.jpg','2001-12-11',7.9,0),(18824,'Spy','en','A desk-bound CIA analyst volunteers to go undercover to infiltrate the world of a deadly arms dealer, and prevent diabolical global disaster.','https://image.tmdb.org/t/p/w500/6On9Ed52fz8W1h9PzaDQ12ZfHdn.jpg','2015-05-06',6.8,0),(18825,'Machete','en','After being set-up and betrayed by the man who hired him to assassinate a Texas Senator, an ex-Federale launches a brutal rampage of revenge against his former boss.','https://image.tmdb.org/t/p/w500/dcPSm1rGEFdiEc7DaKz0t5kb66b.jpg','2010-09-01',6.3,0),(18826,'King Arthur: Legend of the Sword','en','When the child Arthur’s father is murdered, Vortigern, Arthur’s uncle, seizes the crown. Robbed of his birthright and with no idea who he truly is, Arthur comes up the hard way in the back alleys of the city. But once he pulls the sword Excalibur from the stone, his life is turned upside down and he is forced to acknowledge his true legacy... whether he likes it or not.','https://image.tmdb.org/t/p/w500/9kKX