.org/t/p/w500/eCOtqtfvn7mxGl6nfmq4b1exJRc.jpg','2013-12-18',7.9,0),(18847,'Son of the Mask','en','Tim Avery, an aspiring cartoonist, finds himself in a predicament when his dog stumbles upon the mask of Loki. Then after conceiving an infant son \"born of the mask\", he discovers just how looney child raising can be.','https://image.tmdb.org/t/p/w500/Adgnfhm9B8YAQmC0osuP4zO9SRc.jpg','2005-02-18',4.1,0),(18848,'Spy Kids 3-D: Game Over','en','Carmen\'s caught in a virtual reality game designed by the Kids\' new nemesis, the Toymaker. It\'s up to Juni to save his sister, and ultimately the world.','https://image.tmdb.org/t/p/w500/oP53PyexPlQd1xDt8kkvX5LdQdT.jpg','2003-07-25',5.1,0),(18849,'Night Teeth','en','A college student moonlighting as a chauffeur picks up two mysterious women for a night of party-hopping across LA. But when he uncovers their bloodthirsty intentions—and their dangerous, shadowy underworld—he must fight to stay alive.','https://image.tmdb.org/t/p/w500/4niEFGAUEz3GUqwk9Y2y4aAERhE.jpg','2021-10-20',6.5,0),(18850,'The Blair Witch Project','en','In October of 1994 three student filmmakers disappeared in the woods near Burkittsville, Maryland, while shooting a documentary. A year later their footage was found.','https://image.tmdb.org/t/p/w500/9050VGrYjYrEjpOvDZVAngLbg1f.jpg','1999-07-14',6.3,0),(18851,'Skyline','en','When strange lights descend on the city of Los Angeles, people are drawn outside like moths to a flame where an extraterrestrial force threatens to swallow the entire human population off the face of the Earth. Now the band of survivors must fight for their lives as the world unravels around them.','https://image.tmdb.org/t/p/w500/8QpvbnNrtzijlwiM0bFVeilc6lc.jpg','2010-11-11',5,0),(18852,'Army of Darkness','en','Ash is transported back to medieval days, where he is captured by the dreaded Lord Arthur. Aided by the deadly chainsaw that has become his only friend, Ash is sent on a perilous mission to recover the Book of the Dead, a powerful 