sion in Dhaka, Bangladesh, Tyler Rake is back, and his team is ready to take on their next mission. Tasked with extracting a family who is at the mercy of a Georgian gangster, Tyler infiltrates one of the world\'s deadliest prisons in order to save them. But when the extraction gets hot, and the gangster dies in the heat of battle, his equally ruthless brother tracks down Rake and his team to Sydney, in order to get revenge.','https://image.tmdb.org/t/p/w500/fFjLtt5FCNvH5Tj5DB75QMDBFKH.jpg','2023-06-16',0,0),(18859,'Death Race 2','en','In the world\'s most dangerous prison, a new game is born: Death Race. The rules of this adrenaline-fueled blood sport are simple, drive or die. When repentant convict Carl Lucas discovers there\'s a price on his head, his only hope is to survive a twisted race against an army of hardened criminals and tricked-out cars.','https://image.tmdb.org/t/p/w500/80mBFNVvak2bA9TJN1MD0yM7Lfi.jpg','2010-11-12',5.8,0),(18860,'God\'s Not Dead 2','en','When a high school teacher is asked a question in class about Jesus, her reasoned response lands her in deep trouble and could expel God from the public square once and for all.','https://image.tmdb.org/t/p/w500/l0Di5mvlFhIxTn8VPGhcrYE0MCT.jpg','2016-04-01',6.2,0),(18861,'Left Behind','en','A small group of survivors are left behind after millions of people suddenly vanish during the rapture and the world is plunged into chaos and destruction.','https://image.tmdb.org/t/p/w500/b9Q2WR62yB5Aq0hd6kyRFS9cc3Y.jpg','2014-10-03',4.2,0),(18862,'Ghost Ship','en','After discovering a passenger ship missing since 1962 floating adrift on the Bering Sea, salvagers claim the vessel as their own. Once they begin towing the ghost ship towards harbor, a series of bizarre occurrences happen and the group becomes trapped inside the ship, which they soon learn is inhabited by a demonic creature.','https://image.tmdb.org/t/p/w500/o8xH46GiXAFmeFKpIstXJ5FqAL1.jpg','2002-10-25',5.9,0),(18863,'Catch the Bullet','en','U.S. mar