istmas...which happens to be tomorrow!','https://image.tmdb.org/t/p/w500/1NbobWwoX7kFd1if8aCyCtFRZpu.jpg','2002-11-12',6.8,0),(18898,'Airplane!','en','An ex-fighter pilot forced to take over the controls of an airliner when the flight crew succumbs to food poisoning.','https://image.tmdb.org/t/p/w500/hiURvJjCgk0s10urHVCg80TFF11.jpg','1980-07-02',7.3,0),(18899,'Salt','en','As a CIA officer, Evelyn Salt swore an oath to duty, honor and country. Her loyalty will be tested when a defector accuses her of being a Russian spy. Salt goes on the run, using all her skills and years of experience as a covert operative to elude capture. Salt\'s efforts to prove her innocence only serve to cast doubt on her motives, as the hunt to uncover the truth behind her identity continues and the question remains: \"Who is Salt?\"','https://image.tmdb.org/t/p/w500/ppXyhOe8UCEOrBRSYqE3SkHwrcR.jpg','2010-07-21',6.4,0),(18900,'The Jack in the Box','en','When a vintage Jack-in-the-box is un-earthed and opened, it\'s new owners soon have reason to believe the creepy clown doll within has a life of it\'s own.','https://image.tmdb.org/t/p/w500/suaQ6oScsa5rrfx3osJHyQp1ZXb.jpg','2019-11-09',6,0),(18901,'The Perks of Being a Wallflower','en','Pittsburgh, Pennsylvania, 1991. High school freshman Charlie is a wallflower, always watching life from the sidelines, until two senior students, Sam and her stepbrother Patrick, become his mentors, helping him discover the joys of friendship, music and love.','https://image.tmdb.org/t/p/w500/aKCvdFFF5n80P2VdS7d8YBwbCjh.jpg','2012-09-20',7.8,0),(18902,'Dr. No','en','In the film that launched the James Bond saga, Agent 007 battles mysterious Dr. No, a scientific genius bent on destroying the U.S. space program. As the countdown to disaster begins, Bond must go to Jamaica, where he encounters beautiful Honey Ryder, to confront a megalomaniacal villain in his massive island headquarters.','https://image.tmdb.org/t/p/w500/f9HsemSsBEHN5eoMble1bj6fDxs.jpg','1962-10-0