t/p/w500/1CvJ6diBACKPVGOpcWuY4XPQdqX.jpg','2007-11-21',6.9,0),(18927,'Wind River','en','An FBI agent teams with the town\'s veteran game tracker to investigate a murder that occurred on a Native American reservation.','https://image.tmdb.org/t/p/w500/pySivdR845Hom4u4T2WNkJxe6Ad.jpg','2017-08-03',7.4,0),(18928,'Jesus','en','Three and a half years of Jesus\' ministry, as told in the Gospel of Luke.','https://image.tmdb.org/t/p/w500/gJpN9q139yF1vaQftCSe1TmqUVt.jpg','1979-10-19',8.3,0),(18929,'Blitz','en','A tough cop is dispatched to take down a serial killer who has been targeting police officers.','https://image.tmdb.org/t/p/w500/qjqmhhc7uLub22mhu4V6DjOBwXM.jpg','2011-05-20',6.2,0),(18930,'Red Dawn','en','A city in Washington state awakens to the surreal sight of foreign paratroopers dropping from the sky—shockingly, the U.S. has been invaded and their hometown is the initial target. Quickly and without warning, the citizens find themselves prisoners and their town under enemy occupation. Determined to fight back, a group of young patriots seek refuge in the surrounding woods, training and reorganizing themselves into a guerrilla group of fighters.','https://image.tmdb.org/t/p/w500/aHdxKDX36NOEYE2NyAyP7ThuAcm.jpg','2012-03-15',5.7,0),(18931,'Tombstone','en','Legendary marshal Wyatt Earp, now a weary gunfighter, joins his brothers Morgan and Virgil to pursue their collective fortune in the thriving mining town of Tombstone. But Earp is forced to don a badge again and get help from his notorious pal Doc Holliday when a gang of renegade brigands and rustlers begins terrorizing the town.','https://image.tmdb.org/t/p/w500/f6Lb4bpUW2AJW42Hpnix2533RKU.jpg','1993-12-25',7.6,0),(18932,'November','fr','In November 2015, a series of unprecedented and deadly attacks hits Paris. The anti-terrorist police led by Heloise and her chief commander Fred - face an unprecedented level of pressure: in a race against the clock, they must find the perpetrators of the attacks as quickly as possible before they can strike again, travelling across Europe and beyond in one of the biggest manhunts in history.','https://image.tmdb.org/t/p/w500/A5wae5M81jLTuv3WbCJfORxapRA.jpg','2022-10-05',7.4,0),(18933,'Barbie','en','Live-action feature film based on the popular line of Barbie dolls.','https://image.tmdb.org/t/p/w500/xMVsBwvvw1iKhC97rtI5mB91C0O.jpg','2023-07-19',0,0),(18934,'The Greatest Showman','en','The story of American showman P.T. Barnum, founder of the circus that became the famous traveling Ringling Bros. and Barnum & Bailey Circus.','https://image.tmdb.org/t/p/w500/b9CeobiihCx1uG1tpw8hXmpi7nm.jpg','2017-12-20',7.9,0),(18935,'Epic','en','A teenager finds herself transported to a deep forest setting where a battle between the forces of good and the forces of evil is taking place. She bands together with a rag-tag group characters in order to save their world—and ours.','https://image.tmdb.org/t/p/w500/81cSsWzjTfR3cJSqnTiHwy1eyPK.jpg','2013-05-15',6.5,0),(18936,'Dual','en','A terminally ill woman opts for a cloning procedure to ease her loss on her friends and family. When she makes a miraculous recovery, her attempts to have her clone decommissioned fail and lead to a court-mandated duel to the death.','https://image.tmdb.org/t/p/w500/wDEse2TQRiyfhdlusSXBdkDOQRj.jpg','2022-03-18',6.1,0),(18937,'Bleeding Steel','zh','Jackie Chan stars as a hardened special forces agent who fights to protect a young woman from a sinister criminal gang. At the same time, he feels a special connection to the young woman, like they met in a different life.','https://image.tmdb.org/t/p/w500/vL1KMUr0Jj6kEZ5YPZO7VQBZMLl.jpg','2017-12-18',5.9,0),(18938,'A Christmas Carol','en','Miser Ebenezer Scrooge is awakened on Christmas Eve by spirits who reveal to him his own miserable existence, what opportunities he wasted in his youth, his current cruelties, and the dire fate that awaits him if he does not change his ways. Scrooge is faced with his own story of growing bitterness and meanness, and must decide what his own future will hold: death or redemption.','https://image.tmdb.org/t/p/w500/t41VHjYItCYHBh2hijsTID44cNv.jpg','2009-11-04',6.9,0),(18939,'The Huntsman: Winter\'s War','en','As two evil sisters prepare to conquer the land, two renegades—Eric the Huntsman, who aided Snow White in defeating Ravenna in Snowwhite and the Huntsman, and his forbidden lover, Sara—set out to stop them.','https://image.tmdb.org/t/p/w500/ci1QXfBSUBVpLuzxi9A208uwUVi.jpg','2016-04-06',6.3,0),(18940,'Public Enemies','en','Depression-era bank robber John Dillinger\'s charm and audacity endear him to much of America\'s downtrodden public, but he\'s also a thorn in the side of J. Edgar Hoover and the fledgling FBI. Desperate to capture the elusive outlaw, Hoover makes Dillinger his first Public Enemy Number One and assigns his top agent, Melvin Purvis, the task of bringing him in dead or alive.','https://image.tmdb.org/t/p/w500/seSXTeKLSvxSqw07B0SEr7JXQrL.jpg','2009-07-01',6.7,0),(18941,'Return of the Jedi','en','Luke Skywalker leads a mission to rescue his friend Han Solo from the clutches of Jabba the Hutt, while the Emperor seeks to destroy the Rebellion once and for all with a second dreaded Death Star.','https://image.tmdb.org/t/p/w500/q6ydU8r1iYyy2bV7tPVaq266Y1k.jpg','1983-05-25',7.9,0),(18942,'Fool\'s Gold','en','Treasure hunter Ben \"Finn\" Finnegan has sunk his marriage to Tess and his trusty boat in his obsessive quest to find the legendary Queen\'s Dowry. When he finds a vital clue that may finally pinpoint the treasure\'s whereabouts, he drags Tess and her boss, billionaire Nigel Honeycutt, along on the hunt. But Finn is not the only one interested in the gold; his former mentor-turned-enemy Moe Fitch, hired by rapper-turned-gangster Bigg Bunny, will stop at nothing to beat him to it.','https://image.tmdb.org/t/p/w500/b5biG9GbpFq65F6KjpkDrh28EO9.jpg','2008-02-07',5.7,0),(18943,'Toy Story That Time Forgot','en','During a post-Christmas play date, the gang find themselves in uncharted territory when the coolest set of action figures ever turn out to be dangerously delusional. It\'s all up to Trixie, the triceratops, if the gang hopes to return to Bonnie\'s room in this Toy Story That Time Forgot.','https://image.tmdb.org/t/p/w500/pw1YgzcBw4GmwylrFlXMzLdELRo.jpg','2014-12-02',7,0),(18944,'Freddy vs. Jason','en','In an attempt to free himself from a state of forgotten limbo, evil dream-demon Freddy Krueger devises a plan to manipulate un-dead mass murderer Jason Voorhees  into slicing-and-dicing his way through the teenage population of Springwood.  But when the master of dreams loses control of his monster, a brutal fight to the death is the only way out.','https://image.tmdb.org/t/p/w500/vu7JlJMfh0qnBSbaK4c0HmPI4Gq.jpg','2003-08-15',6,0),(18945,'Men of Honor','en','Against formidable odds -- and an old-school diving instructor embittered by the U.S. Navy\'s new, less prejudicial policies -- Carl Brashear sets his sights on becoming the Navy\'s first African-American master diver in this uplifting true story. Their relationship starts out on the rocks, but fate ultimately conspires to bring the men together into a setting of mutual respect, triumph and honor.','https://image.tmdb.org/t/p/w500/wNUAnXV1mzOOfvnVBIYsalkk078.jpg','2000-09-13',7.4,0),(18946,'Prayers for the Stolen','es','In a mountain town, where corn and poppies grow, the girls wear boyish haircuts and have hiding places underground to escape the threat of being stolen. Ana and her two best friends grow up together, affirming the bonds of their friendship and discovering what it means to be women in a rural town marked by violence. Their mothers train them to flee death, to escape those who turn them into slaves or ghosts. They create their own impenetrable universe, but one day one of the girls doesn’t make it to her hiding place in time.','https://image.tmdb.org/t/p/w500/kb0IrVB4bDzBilRNpDv1OPMCs3u.jpg','2021-09-16',7.8,0),(18947,'Yes, God, Yes','en','Alice, a young innocent Catholic girl, is tempted into masturbating after an AOL chat suddenly turns sexual, however is conflicted as the act would be considered a sin.','https://image.tmdb.org/t/p/w500/tDLPRPNKqNCZXEurLTT70rMJpgK.jpg','2020-07-24',6.4,0),(18948,'Jonah Hex','en','Gunslinger Jonah Hex is appointed by President Ulysses Grant to track down terrorist Quentin Turnbull, a former Confederate officer determined on unleashing hell on earth. Jonah not only secures freedom by accepting this task, he also gets revenge on the man who slayed his wife and child.','https://image.tmdb.org/t/p/w500/1MpWjcCn8M0763QDoxcN0gXrc5q.jpg','2010-06-18',4.9,0),(18949,'Batman Beyond: Return of the Joker','en','The Joker is back with a vengeance, and Gotham\'s newest Dark Knight, Terry McGinnis, needs answers as he stands alone to face Gotham\'s most infamous Clown Prince of Crime.','https://image.tmdb.org/t/p/w500/7RlBs0An83fqAuKfwH5gKMcqgMc.jpg','2000-12-12',7.3,0),(18950,'Barbie and the Diamond Castle','en','Liana and Alexa (Barbie and Teresa) are best friends who share everything, including their love of singing. One day while walking through the forest home from the village, the girls meet an old beggar who gives them a magical mirror. As they clean the mirror and sing, a musical apprentice muse named Melody appears in the mirror\'s surface, and tells the girls about the secret of the Diamond Castle.','https://image.tmdb.org/t/p/w500/dvjFM3GgYm3gDZ6Ulw0JurDYs4r.jpg','2008-09-03',7.4,0),(18951,'Barbie and the Magic of Pegasus','en','Princess Annika escapes the clutches of the evil wizard, explores the wonders of Cloud Kingdom, and teams up with a magnificent winged horse - who turns out to be her sister, Princess Brietta - to defeat the wizard and break the spells that imprisoned her family.','https://image.tmdb.org/t/p/w500/wqKNLSzGN9lqnmtFFwu40g2eWgQ.jpg','2005-10-04',7.1,0),(18952,'Melissa P.','it','An adolescent girl, living with her mother and her grandmother, will have her first sexual experiences in a heavy and excessive way.','https://image.tmdb.org/t/p/w500/Cz7ZbqtgUiqKwcmZrkIpHMt8aU.jpg','2005-11-18',4.6,0),(18953,'Underdogs','es','In the small village where Amadeo lives there is no one good enough to challenge his skills at Table Football. But, while Amadeo may be a genius as a table football player in real life he\'s a loser. He\'s in love with Lara, his childhood friend, but he\'s so shy that he can\'t bring himself to confess his love for her. So he just hangs out in his quaint, timeless village. When Amadeo beats the village bully Flash at Table Football. The scene is set for an epic rivalry. Consumed with anger Flash vows to get even and 10 years later he returns as an International Superstar, a Football Icon and Galatico determined to wreak his revenge.','https://image.tmdb.org/t/p/w500/qYGZyLZSMHJdU5tdf4HM8vNZrv3.jpg','2013-07-18',6.6,0),(18954,'Full Metal Jacket','en','A pragmatic U.S. Marine observes the dehumanizing effects the U.S.-Vietnam War has on his fellow recruits from their brutal boot camp training to the bloody street fighting in Hue.','https://image.tmdb.org/t/p/w500/kMKyx1k8hWWscYFnPbnxxN4Eqo4.jpg','1987-06-26',8.1,0),(18955,'Undercover Wedding Crashers','es','Geeky-looking Sebas is a surprisingly good classical musician. He’s also a complete unknown in the criminal underworld, and as a new newbie on the police force, that makes him the perfect man for a dangerous mission: to go undercover as a keyboard player for “Los Lolos”, a cheesy flamenco-trap band, who have been hired to play at the wedding of a local mafia boss’ daughter that a major drug trafficker will be attending.  Sebas is keen to take on the mission, blissfully unaware that he will turn out to be even cheesier than Lolo, the band’s lead singer, and fall in love with his sister, Luci. Now Sebas will face a tough choice: remain loyal to his new friends or complete his police mission.','https://image.tmdb.org/t/p/w500/kZBA6UFI9KTS5kZdEtGmw9PqdWZ.jpg','2021-06-24',6.3,0),(18956,'London Has Fallen','en','In London for the Prime Minister\'s funeral, Mike Banning discovers a plot to assassinate all the attending world leaders.','https://image.tmdb.org/t/p/w500/korY0GInEJThWEm23MRmErQ3GqT.jpg','2016-03-02',6.2,0),(18957,'It\'s a Wonderful Binge','en','Like the original film, the sequel is set in a near future where all drinking and drugs are banned except for on one glorious day known as The Binge. This year, that day happens to miraculously land on Christmas.','https://image.tmdb.org/t/p/w500/hU9ouAPcg2LG7n85WUxjKwPq2y4.jpg','2022-12-09',5.1,0),(18958,'Pets United','en','When Roger (a Robin Hood-esque, stray dog) and Belle (an elegant yet spoilt pet cat) are thrown together amidst the chaos of a robot take-over of their home city, they must push all their preconceptions aside in order to survive, as they embark on a high-stakes, action-packed adventure.','https://image.tmdb.org/t/p/w500/gtwqIYSOCRwEndZTg9s6iWjEZc1.jpg','2019-11-08',5.9,0),(18959,'Mickey and Minnie Wish Upon a Christmas','en','After a series of mishaps, Mickey, Minnie and the gang are separated all over the world and must try to get back to Hot Dog Hills by Christmas Eve. A mysterious and jolly stranger shows up to tell them about The Wishing Star, which could be the secret to bringing everybody home in time to celebrate together.','https://image.tmdb.org/t/p/w500/viZ3SvvQi7CRHJxnSKAG2lHU4AK.jpg','2021-12-02',6.9,0),(18960,'See How They Run','en','In the West End of 1950s London, plans for a movie version of a smash-hit play come to an abrupt halt after a pivotal member of the crew is murdered. When world-weary Inspector Stoppard and eager rookie Constable Stalker take on the case, the two find themselves thrown into a puzzling whodunit within the glamorously sordid theater underground, investigating the mysterious homicide at their own peril.','https://image.tmdb.org/t/p/w500/r3rpSAi2yukZwr9H2km0WKGODWo.jpg','2022-09-09',6.5,0),(18961,'Dilwale Dulhania Le Jayenge','hi','Raj is a rich, carefree, happy-go-lucky second generation NRI. Simran is the daughter of Chaudhary Baldev Singh, who in spite of being an NRI is very strict about adherence to Indian values. Simran has left for India to be married to her childhood fiancé. Raj leaves for India with a mission at his hands, to claim his lady love under the noses of her whole family. Thus begins a saga.','https://image.tmdb.org/t/p/w500/2CAL2433ZeIihfX1Hb2139CX0pW.jpg','1995-10-19',8.6,0),(18962,'Halloween','en','Laurie Strode comes to her final confrontation with Michael Myers, the masked figure who has haunted her since she narrowly escaped his killing spree on Halloween night four decades ago.','https://image.tmdb.org/t/p/w500/wgmniaoxuRfA7waV4wpC7zLPEgX.jpg','2018-10-18',6.5,0),(18963,'Cowboys & Aliens','en','A stranger stumbles into the desert town of Absolution with no memory of his past and a futuristic shackle around his wrist. With the help of mysterious beauty Ella and the iron-fisted Colonel Dolarhyde, he finds himself leading an unlikely posse of cowboys, outlaws, and Apache warriors against a common enemy from beyond this world in an epic showdown for survival.','https://image.tmdb.org/t/p/w500/9uZsGCP4rvOHVGCpMpYq5gNCuNI.jpg','2011-07-29',5.6,0),(18964,'The Brave One','en','A woman struggles to recover from a brutal attack by setting out on a mission for revenge.','https://image.tmdb.org/t/p/w500/9UZ07Rie56aJwPeYPzDDsSyqoc5.jpg','2007-09-12',6.5,0),(18965,'Snowden','en','CIA employee Edward Snowden leaks thousands of classified documents to the press.','https://image.tmdb.org/t/p/w500/yfK7zxNL63VWfluFuoUaJj5PdNw.jpg','2016-09-15',7.1,0),(18966,'Stillwater','en','Bill Baker, an American oil-rig roughneck from Oklahoma, travels to Marseille to visit his estranged daughter, Allison, who is in prison for a murder she claims she did not commit. Confronted with language barriers, cultural differences, and a complicated legal system, Bill builds a new life for himself in France as he makes it his personal mission to exonerate his daughter.','https://image.tmdb.org/t/p/w500/cPdmPwcIcmu0ugfKcdFtI3vmOJq.jpg','2021-07-29',6.7,0),(18967,'Friday','en','Craig and Smokey are two guys in Los Angeles hanging out on their porch on a Friday afternoon, smoking and drinking, looking for something to do.','https://image.tmdb.org/t/p/w500/eqD0jCDIEJ65CmyG63Jaay6bHDp.jpg','1995-04-26',7.2,0),(18968,'The Marriage App','es','Tangled in a troubled marriage, a frustrated couple finds hope in a watch-based app that rewards good deeds — until unhealthy obsessiveness takes over.','https://image.tmdb.org/t/p/w500/kKDOqkbY0jNNv66bHz3ZpFaaRws.jpg','2022-12-07',6.1,0),(18969,'A Classic Horror Story','it','Five people travelling by camper crash into a tree. When they recover, the road they were driving on has been replaced by an impenetrable forest and a wooden house.','https://image.tmdb.org/t/p/w500/xnxGmUof0HiugUaNbUFiS4GJPx4.jpg','2021-07-14',5.9,0),(18970,'Once Upon a Time in America','en','A former Prohibition-era Jewish gangster returns to the Lower East Side of Manhattan over thirty years later, where he once again must confront the ghosts and regrets of his old life.','https://image.tmdb.org/t/p/w500/i0enkzsL5dPeneWnjl1fCWm6L7k.jpg','1984-05-23',8.4,0),(18971,'Death Race: Inferno','en','Carl Lucas / Frankenstein has won four of his races and needs to win one more to win his freedom. Before his final race, Lucas and his team, car and all, are transferred to another prison where they will compete in a Death Race in the desert. Also, at the same time, Ceaser runs into a marketer who wants to franchise the Death Race program.','https://image.tmdb.org/t/p/w500/aRV4oC61nmBqypSaXtMXOk99dOM.jpg','2013-01-04',5.8,0),(18972,'Fatherhood','en','A widowed new dad copes with doubts, fears, heartache and dirty diapers as he sets out to raise his daughter on his own. Inspired by a true story.','https://image.tmdb.org/t/p/w500/pR2fzm82fl0giommpo310LBOMbV.jpg','2021-06-18',7.6,0),(18973,'The BFG','en','The BFG is no ordinary bone-crunching giant. He is far too nice and jumbly. It\'s lucky for Sophie that he is. Had she been carried off in the middle of the night by the Bloodbottler, or any of the other giants—rather than the BFG—she would have soon become breakfast. When Sophie hears that the giants are flush-bunking off to England to swollomp a few nice little chiddlers, she decides she must stop them once and for all. And the BFG is going to help her!','https://image.tmdb.org/t/p/w500/vssXmCrfCiARkQ0512oG0wjh2h9.jpg','2016-06-01',6.3,0),(18974,'9','en','When 9 first comes to life, he finds himself in a post-apocalyptic world. All humans are gone, and it is only by chance that he discovers a small community of others like him taking refuge from fearsome machines that roam the earth intent on their extinction. Despite being the neophyte of the group, 9 convinces the others that hiding will do them no good.','https://image.tmdb.org/t/p/w500/3uqXGOH4BQ2CLJWkDJZ0PzbUzOn.jpg','2009-08-19',6.9,0),(18975,'Fast & Feel Love','th','When a world champion of sport stacking is dumped by his long-time girlfriend, he has to learn basic adulting skills in order to live alone and take care of himself.','https://image.tmdb.org/t/p/w500/46Ab9aS5x9ZVhsbcQ3d5QjzfuBb.jpg','2022-04-06',7,0),(18976,'Mamma Mia!','en','An independent, single mother who owns a small hotel on a Greek island is about to marry off the spirited young daughter she\'s raised alone. But, the daughter has secretly invited three of her mother\'s ex-lovers in the hopes of finding her biological father.','https://image.tmdb.org/t/p/w500/mQy3BuOdf3OSORWOKTodqfRayJM.jpg','2008-07-03',7,0),(18977,'My Policeman','en','In the late 1990s, the arrival of elderly invalid Patrick into Marion and Tom’s home triggers the exploration of seismic events from 40 years previous: the passionate relationship between Tom and Patrick at a time when homosexuality was illegal.','htt