aracters Mera and Atlanna.','https://image.tmdb.org/t/p/w500/pa7m8nqDrEi7hAGB5vTnCkGLPC2.jpg','2019-03-26',6.7,0),(19022,'Carrie','en','Carrie White is a lonely and painfully shy teenage girl with telekinetic powers who is slowly pushed to the edge of insanity by frequent bullying from both classmates at her school, and her own religious, but abusive, mother.','https://image.tmdb.org/t/p/w500/knjeEeeyIwDkUtZwDfJOcUIuNdB.jpg','2002-11-04',6.1,0),(19023,'The Sword','zh','Lord of Darkness Artha was born from human struggle and resentment. In ancient times he formed an army of undead to conquer the world. At the moment of final battle human leaders used blood to forge the holy sword to seal Artha. For thousands of years, legends have fallen one after another, and Artha has made a comeback.','https://image.tmdb.org/t/p/w500/174uwJ0uhlWHbp8FPZRth7SMv6d.jpg','2021-10-18',5.3,0),(19024,'Vanquish','en','Victoria is a young mother trying to put her dark past as a Russian drug courier behind her, but retired cop Damon forces Victoria to do his bidding by holding her daughter hostage. Now, Victoria must use guns, guts and a motorcycle to take out a series of violent gangsters—or she may never see her child again.','https://image.tmdb.org/t/p/w500/AoWY1gkcNzabh229Icboa1Ff0BM.jpg','2021-04-16',5.5,0),(19025,'The Da Vinci Code','en','A murder in Paris’ Louvre Museum and cryptic clues in some of Leonardo da Vinci’s most famous paintings lead to the discovery of a religious mystery. For 2,000 years a secret society closely guards information that — should it come to light — could rock the very foundations of Christianity.','https://image.tmdb.org/t/p/w500/j9lsWwnIDN2ZNtqZcE1x2o4ZKyI.jpg','2006-05-17',6.7,0),(19026,'Vengeance','en','A journalist and podcaster from New York City travels to West Texas in order to report on the death of a girl he was hooking up with.','https://image.tmdb.org/t/p/w500/n1SlTeEv3dNJB3gF9AHAVElQ6LO.jpg','2022-07-29',6.7,0),(19027,'Phone Booth','en','A slick