r the CIA and the Medellin cartel in the 1980s.','https://image.tmdb.org/t/p/w500/23ILgoPSO5ShKcTZOuiTVfqFAUB.jpg','2017-08-18',6.8,0),(19033,'Max Steel','en','The adventures of teenager Max McGrath and alien companion Steel, who must harness and combine their tremendous new powers to evolve into the turbo-charged superhero Max Steel.','https://image.tmdb.org/t/p/w500/AuEzNLF8yvzd169guYEFisqvy5z.jpg','2016-10-14',5.7,0),(19034,'Ancient Chinese Whorehouse','cn','Madam Five and carpenter Kong work together managing a famous whorehouse. Kong\'s apprentice Yat fails to get along with Ching due to a misunderstanding between them. Luckily, the appearance of a murderous rapist helps to resolve the misunderstanding between them. It also unites the group to defend against the sex maniac and to rebuild Madam Five\'s business at a new location.','https://image.tmdb.org/t/p/w500/53AdAWdL7pJnWzvfSfDq30MJaFw.jpg','1994-09-15',5,0),(19035,'Three Identical Strangers','en','New York, 1980. Three complete strangers accidentally discover that they\'re identical triplets, separated at birth. The 19-year-olds\' joyous reunion catapults them to international fame, but also unlocks an extraordinary and disturbing secret that goes beyond their own lives – and could transform our understanding of human nature forever.','https://image.tmdb.org/t/p/w500/esPoJNMBsgWXahv8gILIl5K6sFk.jpg','2018-06-29',7.4,0),(19036,'Cursed','en','In Los Angeles, siblings Ellie and Jimmy come across an accident on Mulholland Drive. As they try to help the woman caught in the wreckage, a ferocious creature attacks them, devouring the woman and scratching the terrified siblings. They slowly discover that the creature was a werewolf and that they have fallen victim to a deadly curse.','https://image.tmdb.org/t/p/w500/em45jL4CfTMyj5V83kj7rhdorJu.jpg','2005-02-25',5.5,0),(19037,'The Outsiders','en','When two poor Greasers, Johnny and Ponyboy, are assaulted by a vicious gang, the Socs, and Johnny kills one of the attackers, tension begins to mount between the two rival gangs, setting off a turbulent chain of events.','https://image.tmdb.org/t/p/w500/fWoauna09D6J1HsFwSlj32L2pOd.jpg','1983-03-25',7.3,0),(19038,'Titanic: 25 Years Later with James Cameron','en','The Academy Award-winning director and National Geographic Explorer-at-Large James Cameron adds a postscript to his fictional retelling of the tragedy. After hearing fans continue to insist Jack didn’t have to die that night, he mounts tests to see, once and for all, whether both Jack and Rose could have fit on that raft and survived.','https://image.tmdb.org/t/p/w500/vZJ5di2WIJ91pytikr5SOzlmSLU.jpg','2023-02-10',10,0),(19039,'Kung Fu Hustle','cn','It\'s the 1940s, and the notorious Axe Gang terrorizes Shanghai. Small-time criminals Sing and Bone hope to join, but they only manage to make lots of very dangerous enemies. Fortunately for them, kung fu masters and hidden strength can be found in unlikely places. Now they just have to take on the entire Axe Gang.','https://image.tmdb.org/t/p/w500/exbyTbrvRUDKN2mcNEuVor4VFQW.jpg','2004-02-10',7.4,0),(19040,'The Dreamers','en','When Isabelle and Theo invite Matthew to stay with them, what begins as a casual friendship ripens into a sensual voyage of discovery and desire in which nothing is off limits and everything is possible.','https://image.tmdb.org/t/p/w500/gBb7GGaFYPu7nEUYvC8G4LaJJN1.jpg','2003-09-01',7.2,0),(19041,'P.O. Box Tinto Brass','it','This film is a series of letters, photos and video cassettes which women often send in to certain newspapers. By visualizing their story-telling (the name given by the psychologists to their fantasies) the film portrays the confessions, the secret longings, the adventures, recollections, dreams, desires and fantasies of these women. It is an open secret that most women dream of forbidden affairs, secret lovers and hasty encounters but when it comes down to it they lack the courage to pursue their dreams.','https://image.tmdb.org/t/p/w500/oGC1ByDVsAjPo8W3G078EYpvBWi.jpg','1995-08-30',5.4,0),(19042,'Héroes de barrio','es','Paula (Luna Fulgencio) is a girl who plays for a girls\' soccer team in a small town in Seville. One day she asks her father, Luis (Antonio Pagudo), to bring her famous Betis player Joaquín as a visitor, as a reward for her and her teammates, whom Luis presumes to be her great friends.','https://image.tmdb.org/t/p/w500/wKBV1jSKGlWmR5IQaQgIKec1I3g.jpg','2022-06-24',5.9,0),(19043,'She\'s the Man','en','Viola Hastings is in a real jam. Complications threaten her scheme to pose as her twin brother, Sebastian, and take his place at a new boarding school. She falls in love with her handsome roommate, Duke, who loves beautiful Olivia, who has fallen for Sebastian! As if that were not enough, Viola\'s twin returns from London ahead of schedule but has no idea that his sister has already replaced him on campus.','https://image.tmdb.org/t/p/w500/gdF2PEBdwoohpPqKL93eCk17zNO.jpg','2006-03-17',6.8,0),(19044,'Father There Is Only One','es','Javier is what we have dubbed as a \"husband-in-law.\" That is that without taking care of the care of the house and children at all, he knows exactly what needs to be done, and that he continuously collects a sum of sentences from the type: \"It is that you do not organize\", or \"do not get nervous\", you already consider that overflowing woman drowns in a glass of water. Javier will have to face the reality of dealing with five children (between four and twelve years old) when his wife decides to go on a trip and leave him alone with them. The chaotic situation that takes place at home will progressively evolve ecologically to the most absolute disaster, but at the same time it will give parents and children the opportunity to meet and enjoy themselves for the first time.','https://image.tmdb.org/t/p/w500/tW6V8C81lzYuRy8yFe1dvvGhL4j.jpg','2019-08-02',7.7,0),(19045,'The Witch','en','In 1630, a farmer relocates his family to a remote plot of land on the edge of a forest where strange, unsettling things happen. With suspicion and paranoia mounting, each family member\'s faith, loyalty and love are tested in shocking ways.','https://image.tmdb.org/t/p/w500/zap5hpFCWSvdWSuPGAQyjUv2wAC.jpg','2015-01-27',6.9,0),(19046,'The Happening','en','When a deadly airborne virus threatens to wipe out the northeastern United States, teacher Elliott Moore and his wife Alma flee from contaminated cities into the countryside in a fight to discover the truth. Is it terrorism, the accidental release of some toxic military bio weapon -- or something even more sinister?','https://image.tmdb.org/t/p/w500/v1Cw6WaCjNqInpAzUwbXB4LGgoX.jpg','2008-06-11',5.3,0),(19047,'A Good Day to Die Hard','en','Iconoclastic, take-no-prisoners cop John McClane, finds himself for the first time on foreign soil after traveling to Moscow to help his wayward son Jack - unaware that Jack is really a highly-trained CIA operative out to stop a nuclear weapons heist. With the Russian underworld in pursuit, and battling a countdown to war, the two McClanes discover that their opposing methods make them unstoppable heroes.','https://image.tmdb.org/t/p/w500/t6tdenc9QnfMymDJa4TzZ8RNnnJ.jpg','2013-02-06',5.3,0),(19048,'Into the Deep','en','Follows a woman desperate to escape her town, she meets a stranger who promises a romantic escape, but it results in deceit, mistrust, and violence.','https://image.tmdb.org/t/p/w500/bPyBqGBYjGzyLVHJEIsCwlZejk.jpg','2022-08-26',6.2,0),(19049,'Parker','en','A thief with a unique code of professional ethics is double-crossed by his crew and left for dead. Assuming a new disguise and forming an unlikely alliance with a woman on the inside, he looks to hijack the score of the crew\'s latest heist.','https://image.tmdb.org/t/p/w500/u1cl4RsdqMjolVVsHwiLRPN1CT2.jpg','2013-01-23',6,0),(19050,'Believe Me: The Abduction of Lisa McVey','en','On the night she plans on taking her own life, 17-year-old \'Lisa McVey\' is kidnapped and finds herself fighting to stay alive and manages to be a victim of rape. She manages to talk her attacker into releasing her, but when she returns home, no one believes her story except for one detective, who suspects she was abducted by a serial killer. Based on horrifying true events.','https://image.tmdb.org/t/p/w500/1X53fMPuNL5FxrSXTLssjYYKhxS.jpg','2018-09-30',8.1,0),(19051,'Daddy\'s Home 2','en','Brad and Dusty must deal with their intrusive fathers during the holidays.','https://image.tmdb.org/t/p/w500/rF2IoKL0IFmumEXQFUuB8LajTYP.jpg','2017-11-09',6.3,0),(19052,'America: The Motion Picture','en','A chainsaw-wielding George Washington teams with beer-loving bro Sam Adams to take down the Brits in a tongue-in-cheek riff on the American Revolution.','https://image.tmdb.org/t/p/w500/1JRRvx5RotvWM1maeq9r82ktdHi.jpg','2021-06-30',5.8,0),(19053,'The Adventures of Tintin','en','Intrepid young reporter, Tintin, and his loyal dog, Snowy, are thrust into a world of high adventure when they discover a ship carrying an explosive secret. As Tintin is drawn into a centuries-old mystery, Ivan Ivanovitch Sakharine suspects him of stealing a priceless treasure. Tintin and Snowy, with the help of salty, cantankerous Captain Haddock and bumbling detectives, Thompson and Thomson, travel half the world, one step ahead of their enemies, as Tintin endeavors to find the Unicorn, a sunken ship that may hold a vast fortune, but also an ancient curse.','https://image.tmdb.org/t/p/w500/mKYkNro2btaWMsnYSuyqrBdHQo3.jpg','2011-10-24',6.9,0),(19054,'L.O.L. Surprise! The Movie','en','Dazzling doll sisters Queen Bee and Royal Bee make their first movie with help from their fashionable friends in this one-of-a-kind magical adventure.','https://image.tmdb.org/t/p/w500/vbc8H3SR3BM6TZkJw6UBN4ekdjK.jpg','2021-10-08',6.9,0),(19055,'Saw III','en','Jigsaw has disappeared. Along with his new apprentice Amanda, the puppet-master behind the cruel, intricate games that have terrified a community and baffled police has once 