cious orphan Lyra Belacqua trades her carefree existence roaming the halls of Jordan College for an otherworldly adventure in the far North, unaware that it\'s part of her destiny.','https://image.tmdb.org/t/p/w500/lyaS7S4emzEaYUcSnCvyqfJpOcA.jpg','2007-12-04',6,0),(19062,'Ken Park','en','Ken Park focuses on several teenagers and their tormented home lives. Shawn seems to be the most conventional. Tate is brimming with psychotic rage; Claude is habitually harassed by his brutish father and coddled, rather uncomfortably, by his enormously pregnant mother. Peaches looks after her devoutly religious father, but yearns for freedom. They\'re all rather tight, or so they claim.','https://image.tmdb.org/t/p/w500/mCFrW8Wdpg7KYBA173DYPVv5FKi.jpg','2002-08-31',5.8,0),(19063,'A-X-L','en','The life of a teenage boy is forever altered by a chance encounter with cutting edge military technology.','https://image.tmdb.org/t/p/w500/9kB56ZdMB6RgY5QtX9Bar45jCeI.jpg','2018-08-23',6.3,0),(19064,'Charlie\'s Angels','en','When a systems engineer blows the whistle on a dangerous technology, Charlie\'s Angels from across the globe are called into action, putting their lives on the line to protect society.','https://image.tmdb.org/t/p/w500/1DPUFG6QnGqzpvEaDEv7TaepycM.jpg','2019-11-14',6.5,0),(19065,'Jumper','en','David Rice is a man who knows no boundaries, a Jumper, born with the uncanny ability to teleport instantly to anywhere on Earth. When he discovers others like himself, David is thrust into a dangerous and bloodthirsty war while being hunted by a sinister and determined group of zealots who have sworn to destroy all Jumpers. Now, David’s extraordinary gift may be his only hope for survival!','https://image.tmdb.org/t/p/w500/3pPZ9JhNz3VMmASVir5SMHvTDUU.jpg','2008-02-13',6.1,0),(19066,'30 Miles from Nowhere','en','When five college pals return to rural Wisconsin for their estranged friend\'s funeral, what begins as an uneasy reunion becomes a terrifying fight for survival.','https://im