X1cKpod2KeK8WuHAHG.jpg','2016-01-22',5.9,0),(19078,'The Hills Have Eyes 2','en','A group of National Guard trainees find themselves battling against a vicious group of mutants on their last day of training in the desert.','https://image.tmdb.org/t/p/w500/kvwuqoHUpPwZv8VWMh38pSCJLct.jpg','2007-03-22',5.5,0),(19079,'Sully','en','On 15 January 2009, the world witnessed the \'Miracle on the Hudson\' when Captain \'Sully\' Sullenberger glided his disabled plane onto the Hudson River, saving the lives of all 155 souls aboard. However, even as Sully was being heralded by the public and the media for his unprecedented feat of aviation skill, an investigation was unfolding that threatened to destroy his reputation and career.','https://image.tmdb.org/t/p/w500/r09ivJ1GGh5WArqRViRYDQLrTVG.jpg','2016-09-07',7.2,0),(19080,'Some Like It Hot','en','Two musicians witness a mob hit and struggle to find a way out of the city before they are found by the gangsters. Their only opportunity is to join an all-girl band as they leave on a tour. To make their getaway they must first disguise themselves as women, then keep their identities secret and deal with the problems this brings - such as an attractive bandmate and a very determined suitor.','https://image.tmdb.org/t/p/w500/hVIKyTK13AvOGv7ICmJjK44DTzp.jpg','1959-03-19',8.1,0),(19081,'Tropic Thunder','en','Ben Stiller, Jack Black and Robert Downey Jr. lead an ensemble cast in \'Tropic Thunder,\' an action comedy about a group of self-absorbed actors who set out to make the most expensive war film. After ballooning costs force the studio to cancel the movie, the frustrated director refuses to stop shooting, leading his cast into the jungles of Southeast Asia, where they encounter real bad guys.','https://image.tmdb.org/t/p/w500/zAurB9mNxfYRoVrVjAJJwGV3sPg.jpg','2008-08-09',6.6,0),(19082,'Shattered','en','Chris, a wealthy divorcee, lives in a high-tech house of his own design in Montana. His life changes when he meets Sky, a mysterious young woman who draws him out of his shell and moves in after Chris is injured.','https://image.tmdb.org/t/p/w500/bkMhuIYybOmw0rdIKPzsDs4n7ez.jpg','2022-01-14',5.7,0),(19083,'Jojo Rabbit','en','A World War II satire that follows a lonely German boy whose world view is turned upside down when he discovers his single mother is hiding a young Jewish girl in their attic. Aided only by his idiotic imaginary friend, Adolf Hitler, Jojo must confront his blind nationalism.','https://image.tmdb.org/t/p/w500/7GsM4mtM0worCtIVeiQt28HieeN.jpg','2019-10-18',8.1,0),(19084,'Don\'t Breathe','en','A group of teens break into a blind man\'s home thinking they\'ll get away with the perfect crime. They\'re wrong.','https://image.tmdb.org/t/p/w500/8fIgsHFQtg47xxN7SBwZkg0tZJn.jpg','2016-06-08',7,0),(19085,'Ex Machina','en','Caleb, a coder at the world\'s largest internet company, wins a competition to spend a week at a private mountain retreat belonging to Nathan, the reclusive CEO of the company. But when Caleb arrives at the remote location he finds that he will have to participate in a strange and fascinating experiment in which he must interact with the world\'s first true artificial intelligence, housed in the body of a beautiful robot girl.','https://image.tmdb.org/t/p/w500/dmJW8IAKHKxFNiUnoDR7JfsK7Rp.jpg','2015-01-21',7.6,0),(19086,'On the Third Day','es','Cecilia and her son embark on a journey. On the third day, she is found wandering alone, not remembering what happened during this time. She is desperately looking for her son and finds herself wrapped in a brutal hunt, carried out by a religious fanatic, whom she faces off against. To her, he\'s a lunatic. To him, Cecilia is the enemy.','https://image.tmdb.org/t/p/w500/thkpxLLHfRLRjhaBsaeT2b5ErpD.jpg','2020-12-04',5.6,0),(19087,'The Pianist','en','The true story of pianist Władysław Szpilman\'s experiences in Warsaw during the Nazi occupation. When the Jews of the city find themselves forced into a ghetto, Szpilman finds work playing in a café; and when his family is deported in 1942, he stays behind, works for a while as a laborer, and eventually goes into hiding in the ruins of the war-torn city.','https://image.tmdb.org/t/p/w500/2hFvxCCWrTmCYwfy7yum0GKRi3Y.jpg','2002-09-17',8.4,0),(19088,'American Gangster','en','Following the death of his employer and mentor, Bumpy Johnson, Frank Lucas establishes himself as the number one importer of heroin in the Harlem district of Manhattan. He does so by buying heroin directly from the source in South East Asia and he comes up with a unique way of importing the drugs into the United States. Partly based on a true story.','https://image.tmdb.org/t/p/w500/sX9idXDqRUxE5ffww3n3RV5gL55.jpg','2007-11-02',7.6,0),(19089,'Doblemente Embarazada 2','es','','https://image.tmdb.org/t/p/w500/mNkAOFyb4TV2gTSc92jx2O9evtj.jpg','2022-08-05',7.4,0),(19090,'RED','en','After surviving an assault from a squad of hit men, retired CIA black ops agent Frank Moses reassembles his old team for an all-out war. Frank reunites with old Joe, crazy Marvin and wily Victoria to uncover a massive conspiracy that threatens their lives. Only their expert training will allow them to survive a near-impossible mission -- breaking into CIA headquarters.','https://image.tmdb.org/t/p/w500/8eeK3OB5PeSRQD7BpZcGZKkehG.jpg','2010-10-13',6.7,0),(19091,'The Princess Diaries 2: Royal Engagement','en','Mia Thermopolis is now a college graduate and on her way to Genovia to take up her duties as princess. Her best friend Lilly also joins her for the summer. Mia continues her \'princess lessons\'- riding horses side-saddle, archery, and other royal. But her complicated life is turned upside down once again when she not only learns that she is to take the crown as queen earlier than expected...','https://image.tmdb.org/t/p/w500/9GkLjwvqjwDfLZkWLGjLLfQf2Be.jpg','2004-08-06',6.7,0),(19092,'The Time Traveler\'s Wife','en','Due to a genetic disorder, handsome librarian Henry DeTamble involuntarily zips through time, appearing at various moments in the life of his true love, the beautiful artist Clare Abshire.','https://image.tmdb.org/t/p/w500/J3ewuzQwhFro0pDpdcbZ4j7MYy.jpg','2009-08-14',6.9,0),(19093,'Tremors: A Cold Day in Hell','en','Burt Gummer (Michael Gross) and his son Travis Welker (Jamie Kennedy) find themselves up to their ears in Graboids and Ass-Blasters when they head to Canada to investigate a series of deadly giant-worm attacks. Arriving at a remote research facility in the artic tundra, Burt begins to suspect that Graboids are secretly being weaponized, but before he can prove his theory, he is sidelined by Graboid venom. With just 48 hours to live, the only hope is to create an antidote from fresh venom — but to do that, someone will have to figure out how to milk a Graboid!','https://image.tmdb.org/t/p/w500/aFOdiHaRjeTmHG67e5B7md2Q1cq.jpg','2018-05-01',6,0),(19094,'Tusk','en','When his best friend and podcast co-host goes missing in the backwoods of Canada, a young guy joins forces with his friend\'s girlfriend to search for him.','https://image.tmdb.org/t/p/w500/pHghiDnQ63O7MiItD6CaSz2jjnr.jpg','2014-09-19',5.5,0),(19095,'True Lies','en','A fearless, globe-trotting, terrorist-battling secret agent has his life turned upside down when he discovers his wife might be having an affair with a used car salesman while terrorists smuggle nuclear war heads into the United States.','https://image.tmdb.org/t/p/w500/pweFTnzzTfGK68woSVkiTgjLzWm.jpg','1994-07-15',7,0),(19096,'The Ring Two','en','Rachel Keller must prevent evil Samara from taking possession of her son\'s soul.','https://image.tmdb.org/t/p/w500/8Mnthy6ymdKHVwVw5gJB7RtaO1F.jpg','2005-03-17',5.7,0),(19097,'The Mummy','en','Though safely entombed in a crypt deep beneath the unforgiving desert, an ancient queen whose destiny was unjustly taken from her is awakened in our current day, bringing with her malevolence grown over millennia, and terrors that defy human comprehension.','https://image.tmdb.org/t/p/w500/zxkY8byBnCsXodEYpK8tmwEGXBI.jpg','2017-06-06',5.5,0),(19098,'Joy','en','A story based on the life of a struggling Long Island single mom who became one of the country\'s most successful entrepreneurs.','https://image.tmdb.org/t/p/w500/q9sDzrrXhE39DQsg2bbP2YfaZjk.jpg','2015-12-24',6.5,0),(19099,'Lady Chatterley\'s Lover','en','A film adaptation of D.H. Lawrence\'s novel. After a crippling injury leaves her husband impotent, Lady Chatterly is torn between her love for her husband and her physical desires. With her husband\'s consent, she seeks out other means of fulfilling her needs.','https://image.tmdb.org/t/p/w500/3H58M1rUGO9AOve8GR0svRGmjau.jpg','1981-06-29',5.4,0),(19100,'The Man from Rome','en','','https://image.tmdb.org/t/p/w500/m1UiIK8ENvvcjuZHwo0X4cs8uGz.jpg','2022-10-21',5,0),(19101,'All My Life','en','It was a chance meeting started by one of Sol’s friends trying to chat up Jennifer. However, in the end, it was those two who hit it off. Sol enjoyed Jen’s smile, her effort, and how silly she could be. Jen enjoyed Sol’s cooking, his athleticism, and that he would join her in fun moments. As you can imagine, love bloomed, and things got serious. Jen’s investment in Sol led to her pushing him to follow his dreams and even move in to save money. Sol’s investment in Jen well, it led to him proposing. But what started as a liver tumor grew into full-on cancer, so with a diagnosis of 6 months to live, Sol and Jennifer try to make the best of it.','https://image.tmdb.org/t/p/w500/xoKZ4ZkVApcTaTYlGoZ3J8xcIzG.jpg','2020-10-23',8,0),(19102,'Obsession','nl','Simone inherits a dilapidated farmhouse in France and makes her way there with her husband Eric and their two children. Her dream is to turn the house into a bed and breakfast but as the hectic pace of the rebuilding gets underway, she gets caught up in the romance and chaos of it all. Losing sight of her goals, she must find her way back to the dreams and ambitions which brought her there in the first place.','https://image.tmdb.org/t/p/w500/39dr21LlR2uv7InD04aKbKIXiFW.jpg','2015-06-04',6.4,0),(19103,'No Good Deed','en','Terri is a devoted wife and mother of two, living an ideal suburban life in Atlanta when Colin, a charming but dangerous escaped convict, shows up at her door claiming car trouble. Terri offers her phone to help him but soon learns that no good deed goes unpunished as she finds herself fighting for survival when he invades her home and terrorizes her family.','https://image.tmdb.org/t/p/w500/wcDLqCS70LsPcovieuQrb311Qr1.jpg','2014-09-10',6,0),(19104,'You Don\'t Mess with the Zohan','en','An Israeli counterterrorism soldier with a secretly fabulous ambition to become a Manhattan hairstylist. Zohan\'s desire runs so deep that he\'ll do anything -- including faking his own death and going head-to-head with an Arab cab driver -- to make his dreams come true.','https://image.tmdb.org/t/p/w500/gBhLQmpCPoKFMCGsulMbIFzrBID.jpg','2008-06-05',5.7,0),(19105,'12 Strong','en','A team of special forces head into Afghanistan in the aftermath of the September 11th attacks in an attempt to dismantle the Taliban.','https://image.tmdb.org/t/p/w500/j18021qCeRi3yUBtqd2UFj1c0RQ.jpg','2018-01-16',6.2,0),(19106,'The Sorcerer\'s Apprentice','en','Balthazar Blake is a master sorcerer in modern-day Manhattan trying to defend the city from his arch-nemesis, Maxim Horvath. Balthazar can\'t do it alone, so he recruits Dave Stutler, a seemingly average guy who demonstrates hidden potential, as his reluctant protégé. The sorcerer gives his unwilling accomplice a crash course in the art and science of magic, and together, these unlikely partners work to stop the forces of darkness.','https://image.tmdb.org/t/p/w500/b5pIUsGll0418NyfNA5eYCI9aoK.jpg','2010-07-13',6.1,0),(19107,'What a Father!','es','Pedro is a single man in his forties who likes to party, has no children and lives at night. Everything changes when he meets Alin. She mentions to him that she is looking for her dad and that there is a high probability that it is him.','https://image.tmdb.org/t/p/w500/wGcxQDM60CDgKeBzsCg0pV6RAyW.jpg','2022-02-09',8.3,0),(19108,'127 Hours','en','The true story of mountain climber Aron Ralston\'s remarkable adventure to save himself after a fallen boulder crashes on his arm and traps him in an isolated canyon in Utah.','https://image.tmdb.org/t/p/w500/mS6f1i1uC7TOUzvbWLrbDepFaZW.jpg','2010-11-12',7.1,0),(19109,'Barbie and the Three Musketeers','en','Corinne (Barbie) is a young country girl who heads to Paris to pursue her big dream – to become a female musketeer! Never could she imagine she would meet three other girls who secretly share the same dream! Using their special talents, the girls work together as a team to foil a plot and save the prince. It\'s all for one and one for all!','https://image.tmdb.org/t/p/w500/zR0ts7zL2P1kQIQXYlnS4KCqqmu.jpg','2009-09-15',7.2,0),(19110,'Planes','en','Dusty is a cropdusting plane who dreams of competing in a famous aerial race. The problem? He is hopelessly afraid of heights. With the support of his mentor Skipper and a host of new friends, Dusty sets off to make his dreams come true.','https://image.tmdb.org/t/p/w500/yVbtaT9HQaJVNwhCXzh5AeJt9G8.jpg','2013-08-09',5.9,0),(19111,'21 Bridges','en','An embattled NYPD detective, is thrust into a citywide manhunt for a pair of cop killers after uncovering a massive and unexpected conspiracy. As the night unfolds, lines become blurred on who he is pursuing, and who is in pursuit of him.','https://image.tmdb.org/t/p/w500/kDlmrGZROewneCoSwPjKx6Qfown.jpg','2019-10-24',6.8,0),(19112,'The Many Adventures of Winnie the Pooh','en','Whether we’re young or forever young at heart, the Hundred Acre Wood calls to that place in each of us that still believes in magic. Join pals Pooh, Piglet, Kanga, Roo, Owl, Rabbit, Tigger and Christopher Robin as they enjoy their days together and sing their way through adventures.','https://image.tmdb.org/t/p/w500/njqwnMbU0OtmD87Rc5vM7fNjv9T.jpg','1977-03-11',7.2,0),(19113,'Diary of a Nymphomaniac','es','A chronicle of the life of a middle-class French girl\'s sexual adventures, her then fall into prostitution, and her ultimate redemption.','https://image.tmdb.org/t/p/w500/yVYTeiFv7oQsSQF9OBRngg7ZqLg.jpg','2008-10-17',5.5,0),(19114,'Un novio para mi mujer','en','Diego wants to separate from his wife, Lucía, but he doesn\'t know how to tell her. He is fed up with her neuroses and constant complaints about him, and he has long since lost the spark that made him fall in love. Unable to say it to her face, he turns to Cuervo Flores, a famous seducer \"from before\", who will try to make Lucía fall in love so that she will be the one to end her marriage.','https://image.tmdb.org/t/p/w500/AbgXT9glk2O0ELr5JPTikRJtt9Q.jpg','2022-07-22',5.5,0),(19115,'You Only Live Twice','en','A mysterious spacecraft captures Russian and American space capsules and brings the two superpowers to the brink of war. James Bond investigates the case in Japan and comes face to face with his archenemy Blofeld.','https://image.tmdb.org/t/p/w500/8axcRNpDi1W6SQTpK2tblDhcFa8.jpg','1967-06-13',6.5,0),(19116,'The Little Prince','en','Based on the best-seller book \'The Little Prince\', the movie tells the story of a little girl that lives with resignation in a world where efficiency and work are the only dogmas. Everything will change when accidentally she discovers her neighbor that will tell her about the story of the Little Prince that he once met.','https://image.tmdb.org/t/p/w500/je5Z7gbFTzrs3FPHINo9yGiHoVo.jpg','2015-07-29',7.6,0),(19117,'Samson and Delilah','en','When strongman Samson rejects the love of the beautiful Philistine woman Delilah, she seeks vengeance that brings horrible consequences they both regret. The classic story of Samson and Delilah as told by Cecil B. DeMille.','https://image.tmdb.org/t/p/w500/iNb2KMv056vpCJycqFp5Xbpw61Z.jpg','1949-12-21',6.5,0),(19118,'Mirreyes vs. Godínez 2: El retiro','es','','https://image.tmdb.org/t/p/w500/ba6CNrM9CdSVGR61NUHJ1uDfmLz.jpg','2022-07-21',7.5,0),(19119,'Sex Doll','fr','Set in London\'s world of high class call girls, Amoureux Solitaires tells the story of London based French escort Virginie, and Rupert, a man who rescues trafficked girls.','https://image.tmdb.org/t/p/w500/grWS1nNexgCQacAIF6Um5PS5N5y.jpg','2016-12-07',5.8,0),(19120,'Father of the Bride','en','A father coming to grips with his daughter’s upcoming wedding through the prism of multiple relationships within a big, sprawling Cuban-American family.','https://image.tmdb.org/t/p/w500/chKMG9tzFqSkj24ejXTio156Qo0.jpg','2022-07-21',6.7,0),(19121,'Mission: Impossible II','en','With computer genius Luther Stickell at his side and a beautiful thief on his mind, agent Ethan Hunt races across Australia and Spain to stop a former IMF agent from unleashing a genetically engineered biological weapon called Chimera. This mission, should Hunt choose to accept it, plunges him into the center of an international crisis of terrifying magnitude.','https://image.tmdb.org/t/p/w500/1VMWLpk9VXyYcEZ8w3uUhp0OF1v.jpg','2000-05-24',6.1,0),(19122,'Spoiled Brats','fr','The billionaire is tired of the whims of his own children and decides to teach them a lesson. He announces to them that he has become bankrupt. Now spoiled teenagers will have to do what they have never done: go to work, learn to love and value life.','https://image.tmdb.org/t/p/w500/nW5LHayHlbavYD6XRM9SjKi55uu.jpg','2021-09-15',6.2,0),(19123,'Cannibal Holocaust','it','A New York University professor returns from a rescue mission to the Amazon rainforest with the footage shot by a lost team of documentarians who were making a film about the area\'s local cannibal tribes.','https://image.tmdb.org/t/p/w500/1g2UQtHq77k4Pvhq5wxlTVexnTY.jpg','1980-02-07',6.3,0),(19124,'Beneath the Planet of the Apes','en','The sole survivor of an interplanetary rescue mission discovers a planet ruled by apes, and an underground city run by telepathic humans.','https://image.tmdb.org/t/p/w500/szHCeYwi4ubewuYnlnz0YGqWnQC.jpg','1970-04-23',6.2,0),(19125,'30 Minutes or Less','en','Two fledgling criminals kidnap a pizza delivery guy, strap a bomb to his chest, and advise him that he has mere hours to rob a bank or else...','https://image.tmdb.org/t/p/w500/iwPiophp3orJcIpAf5TJG6yzUJL.jpg','2011-08-11',5.7,0),(19126,'Armageddon Time','en','In 1980, Queens, New York, a young Jewish boy befriends a rebellious African-American classmate to the disapproval of his privileged family and begins to reckon with growing up in a world of inequality and prejudice.','https://image.tmdb.org/t/p/w500/d0fkTMTN91f0tehqVKG9D9JMsDR.jpg','2022-10-28',6.7,0),(19127,'Blade: Trinity','en','For years, Blade has fought against the vampires in the cover of the night. But now, after falling into the crosshairs of the FBI, he is forced out into the daylight, where he is driven to join forces with a clan of human vampire hunters he never knew existed—The Nightstalkers. Together with Abigail and Hannibal, two deftly trained Nightstalkers, Blade follows a trail of blood to the ancient creature that is also hunting him—the original vampire, Dracula.','https://image.tmdb.org/t/p/w500/rodqqX8NLe3cdcgBMc4CFTPidTy.jpg','2004-12-08',5.9,0),(19128,'The Bourne Identity','en','Wounded to the brink of death and suffering from amnesia, Jason Bourne is rescued at sea by a fisherman. With nothing to go on but a Swiss bank account number, he starts to reconstruct his life, but finds that many people he encounters want him dead. However, Bourne realizes that he has the combat and mental skills of a world-class spy—but who does he work for?','https://image.tmdb.org/t/p/w500/vN6jGCuzefysLVFrzK3Vs6xAdu1.jpg','2002-06-14',7.4,0),(19129,'Bros','en','Two emotionally unavailable men attempt a relationship.','https://image.tmdb.org/t/p/w500/op02Hv5i4Z049nGJYmk6BScRqHO.jpg','2022-09-30',7.1,0),(19130,'Baba Yaga: Terror of the Dark Forest','ru','The young family who moved to a new apartment on the outskirts of the city. The nanny hired by them for the newborn daughter quickly gained confidence. However, the older boy, Egor, talks about the frightening behavior of a woman, but his parents do not believe him. The surveillance cameras installed by the father for comfort only confirm everything is in order. Then one day, Egor, returning home, finds no trace of either the nanny or the little sister, and the parents are in a strange trance and do not even remember that they had a daughter. Then Egor, together with his friends, goes in search, during which it turns out that the nanny is an ancient Slavic demon, popularly known as Baba Yaga.','https://image.tmdb.org/t/p/w500/8m5HTXzwewlfXhtZtLlLts53YTW.jpg','2020-02-27',5.9,0),(19131,'Mystic River','en','The lives of three men who were childhood friends are shattered when one of them has a family tragedy.','https://image.tmdb.org/t/p/w500/e2VNohx5jb7I6HUamCuGhKvzXDR.jpg','2003-01-01',7.7,0),(19132,'Police Academy','en','New rules enforced by the Lady Mayoress mean that sex, weight, height and intelligence need no longer be a factor for joining the Police Force. This opens the floodgates for all and sundry to enter the Police Academy, much to the chagrin of the instructors. Not everyone is there through choice, though. Social misfit Mahoney has been forced to sign up as the only alternative to a jail sentence and it doesn\'t take long before he falls foul of the boorish Lieutenant Harris. But before long, Mahoney realises that he is enjoying being a police cadet and decides he wants to stay... while Harris decides he wants Mahoney out!','https://image.tmdb.org/t/p/w500/CZoeavxfCWcoQP5zW6fTxgNKXy.jpg','1984-03-22',6.6,0),(19133,'The Texas Chain Saw Massacre','en','When Sally hears that her grandfather\'s grave may have been vandalized, she and her paraplegic brother, Franklin, set out with their friends to investigate. After a detour to their family\'s old farmhouse, they discover a group of crazed, murderous outcasts living next door. As the group is attacked one by one by the chainsaw-wielding Leatherface, who wears a mask of human skin, the survivors must do everything they can to escape.','https://image.tmdb.org/t/p/w500/9s8uSm5K1W0vhGPHv2icM6SFib8.jpg','1974-10-01',7.3,0),(19134,'Ben-Hur','en','In 25 AD,Judah Ben-Hur, a Jew in ancient Judea, opposes the occupying Roman empire.  Falsely accused by a Roman childhood friend-turned-overlord of trying to kill the Roman governor, he is put into slavery and his mother and sister are taken away as prisoners.  Three years later and freed by a grateful Roman galley commander whom he has rescued from drowning, he becomes an expert charioteer for Rome, all the while plotting to return to Judea, find and rescue his family, and avenge himself on his former friend.  All the while, the form and work of Jesus move in the background of his life...','https://image.tmdb.org/t/p/w500/m4WQ1dBIrEIHZNCoAjdpxwSKWyH.jpg','1959-11-18',7.8,0),(19135,'Mary Poppins','en','Mr Banks is looking for a nanny for his two mischievous children and comes across Mary Poppins, an angelic nanny. She not only brings a change in their lives but also spreads happiness.','https://image.tmdb.org/t/p/w500/ei8hhYCMfURfPOXKBnyl61be2iV.jpg','1964-12-17',7.6,0),(19136,'The Crush','en','A precocious and obsessive teenager develops a crush on a naive writer with harrowing consequences.','https://image.tmdb.org/t/p/w500/yLjDOHZ56VBYLg5m3ohx4hMcTtO.jpg','1993-04-02',6.5,0),(19137,'South Park: Post COVID','en','What happened to the children who lived through the Pandemic? Stan, Kyle, Cartman and Kenny survived but will never be the same Post Covid.','https://image.tmdb.org/t/p/w500/abDxPtElhJnLnnJxgMqJ1N2H8yl.jpg','2021-11-25',7.2,0),(19138,'Perras','es','Something terrible is happening in class 3A at Calmecatl Junior High. No one can leave the classroom until the guilty party is found. This is the device that gives us a glimpse of the ethics, games, esthetics and eroticism 