uries to come, and it\'s up to teenagers in 1994 to finally put an end to their town\'s curse, before it\'s too late.','https://image.tmdb.org/t/p/w500/rmEPtz3Ufzol2VWUAZYzOFaBio3.jpg','2021-07-14',7.2,0),(19165,'Addams Family Reunion','en','The Addams Family goes on a search for their relatives. Gomez and Morticia are horrified to discover that Grandpa and Grandma Addams have a disease that is slowly turning them \"normal\". The only chance they have of a cure is to find a family member hoping that they know a home remedy.','https://image.tmdb.org/t/p/w500/XtfNBKnLDpg1waJhDF5FAd5OEX.jpg','1998-12-24',4.8,0),(19166,'The Red Thread','es','Seven years after their first infatuated encounter, Abril and Manuel meet again. Despite the fact that they are both married, it is soon apparent that their attraction has only grown.','https://image.tmdb.org/t/p/w500/bQfSIreXxSilnDJFOKhZzdN58ZK.jpg','2016-05-19',6.3,0),(19167,'Samson','en','After losing the love of his life to a cruel Philistine prince, a young Hebrew with Supernatural strength defends his people, sacrificing everything to avenge his love, his people, and his God.','https://image.tmdb.org/t/p/w500/v7Zaj1IEzMMB7KzfglpxdXWB66u.jpg','2018-02-16',5.8,0),(19168,'Doctor Sleep','en','Still irrevocably scarred by the trauma he endured as a child at the Overlook, Dan Torrance has fought to find some semblance of peace. But that peace is shattered when he encounters Abra, a courageous teenager with her own powerful extrasensory gift, known as the \'shine\'. Instinctively recognising that Dan shares her power, Abra has sought him out, desperate for his help against the merciless Rose the Hat and her followers.','https://image.tmdb.org/t/p/w500/p69QzIBbN06aTYqRRiCOY1emNBh.jpg','2019-10-30',7.1,0),(19169,'Ouija: Origin of Evil','en','In 1965 Los Angeles, a widowed mother and her two daughters add a new stunt to bolster their séance scam business and unwittingly invite authentic evil into their home. When the youngest daughter i