man has emerged as the unchallenged successor to Jigsaw\'s legacy. However, when the FBI draws closer to Hoffman, he is forced to set a game into motion, and Jigsaw\'s grand scheme is finally understood.','https://image.tmdb.org/t/p/w500/9fFI57FuE9X4pUCIiKZZZCB7caK.jpg','2009-10-16',6.3,0),(19175,'There\'s Something About Mary','en','For Ted, prom night went about as bad as it’s possible for any night to go. Thirteen years later, he finally gets another chance with his old prom date, only to run up against other suitors including the sleazy detective he hired to find her.','https://image.tmdb.org/t/p/w500/g03pwohXHOI75InM3zraiaEGguO.jpg','1998-07-15',6.6,0),(19176,'The Mystery of Marilyn Monroe: The Unheard Tapes','en','This documentary explores the mystery surrounding the death of movie icon Marilyn Monroe through previously unheard interviews with her inner circle.','https://image.tmdb.org/t/p/w500/9Ab3MEngH2sWK8uydGBFfgZDB4z.jpg','2022-04-27',6.4,0),(19177,'Pleasure or Pain','en','A young designer falls under a man\'s erotic spell and is drawn into a world of sexual abandon from which she may never return.','https://image.tmdb.org/t/p/w500/hPsB2NZozctyxl9juWPZzdIpHxa.jpg','2013-09-05',4.8,0),(19178,'The Flintstones','en','Modern Stone Age family the Flintstones hit the big screen in this live-action version of the classic cartoon. Fred helps Barney adopt a child. Barney sees an opportunity to repay him when Slate Mining tests its employees to find a new executive. But no good deed goes unpunished.','https://image.tmdb.org/t/p/w500/ocsb0qiGlcn6UlcDRHa3xxSCc8Y.jpg','1994-05-26',5.3,0),(19179,'She\'s the One','it','What if you could answer any question and eliminate all doubts before making the most important decision of your life? What if, by some sort of magic, you could live your life pursuing your wildest and deepest desires? That’s what’s about to happen to Andrea, a thirty-year-old man on the eve of his wedding with Laura, the girl he met in college and with whom he built a life together. Andrea starts waking up everyday in a different life and a different self, in realities where he and Laura never got together in the first place. Exploring the many paths his life could have lead him on to, from unapologetic womanizer to acclaimed musician, Andrea will have to face the void Laura’s absence left in his many different “iterations”. Will he try to break the spell?','https://image.tmdb.org/t/p/w500/rK7N0tLvsVK2RUpytz172MxSfHj.jpg','2022-04-04',6.2,0),(19180,'Death Race: Beyond Anarchy','en','Black Ops specialist Connor Gibson infiltrates a maximum security prison to take down legendary driver Frankenstein in a violent and brutal car race.','https://image.tmdb.org/t/p/w500/1PrlKvPUbDQAqFQBCyyt68hLLl.jpg','2018-10-02',6.3,0),(19181,'Dark City','en','A man struggles with memories of his past, including a wife he cannot remember, in a nightmarish world with no sun and run by beings with telekinetic powers who seek the souls of humans.','https://image.tmdb.org/t/p/w500/AdBe2ow8hdlT2aLBYuUjs0Xkqkw.jpg','1998-02-27',7.3,0),(19182,'Red Sparrow','en','Prima ballerina, Dominika Egorova faces a bleak and uncertain future after she suffers an injury that ends her career. She soon turns to Sparrow School, a secret intelligence service that trains exceptional young people to use their minds and bodies as weapons. Dominika emerges as the most dangerous Sparrow after completing the sadistic training process. As she comes to terms with her new abilities, she meets a CIA agent who tries to convince her that he is the only person she can trust.','https://image.tmdb.org/t/p/w500/vLCogyfQGxVLDC1gqUdNAIkc29L.jpg','2018-02-28',6.5,0),(19183,'Ella Enchanted','en','Ella lives in a magical world in which each child, at the moment of their birth, is given a virtuous \"gift\" from a fairy godmother. Ella\'s so-called gift, however, is obedience. This birthright proves itself to be quite the curse once Ella finds herself in the hands of several unscrupulous characters whom she quite literally cannot disobey. Determined to gain control of her life and decisions, Ella sets off on a journey to find her fairy godmother who she hopes will lift the curse. The path, however, isn\'t easy -- Ella must outwit a slew of unpleasant obstacles including ogres, giants, wicked stepsisters, elves and Prince Charmont\'s evil uncle, who wants to take over the crown and rule the kingdom.','https://image.tmdb.org/t/p/w500/dH8yHmqUra0gqzMJJKXiyfKkB57.jpg','2004-04-09',6.4,0),(19184,'The Dinosaur Project','en','Found footage of an expedition into the Congo jungle where a team of explorers stumbles upon a colony of Dinosaurs.','https://image.tmdb.org/t/p/w500/rUAsgohDDBWLb24FyxdjEZQPava.jpg','2012-08-09',5.6,0),(19185,'What\'s Eating Gilbert Grape','en','Gilbert Grape is a small-town young man with a lot of responsibility. Chief among his concerns are his mother, who is so overweight that she can\'t leave the house, and his mentally impaired younger brother, Arnie, who has a knack for finding trouble. Settled into a job at a grocery store and an ongoing affair with local woman Betty Carver, Gilbert finally has his life shaken up by the free-spirited Becky.','https://image.tmdb.org/t/p/w500/8FxWgsfDNosewo7H65oE4QkOb7g.jpg','1993-12-17',7.7,0),(19186,'Taurus','en','A rising but troubled musician searches for the inspiration to record one last song, pushing himself deep into the void.','https://image.tmdb.org/t/p/w500/bWH1s160oYX1vybg3zPnL4ygMpw.jpg','2022-11-18',6.3,0),(19187,'Who Framed Roger Rabbit','en','\'Toon star Roger is worried that his wife Jessica is playing pattycake with someone else, so the studio hires detective Eddie Valiant to snoop on her. But the stakes are quickly raised when Marvin Acme is found dead and Roger is the prime suspect.','https://image.tmdb.org/t/p/w500/lYfRc57Kx9VgLZ48iulu0HKnM15.jpg','1988-06-21',7.5,0),(19188,'God\'s Not Dead','en','After he refuses to disavow his faith, a devout Christian student must prove the existence of God or else his college philosophy professor will fail him.','https://image.tmdb.org/t/p/w500/yKUzBolWrwyByevBtDPfy3kIumv.jpg','2014-03-21',6,0),(19189,'Oz the Great and Powerful','en','Oscar Diggs, a small-time circus illusionist and con-artist, is whisked from Kansas to the Land of Oz where the inhabitants assume he\'s the great wizard of prophecy, there to save Oz from the clutches of evil.','https://image.tmdb.org/t/p/w500/tkzfAUEKoUp4YFNbZV9hfpZOz0z.jpg','2013-03-07',5.9,0),(19190,'Remember Me','en','Still reeling from a heartbreaking family event and his parents\' subsequent divorce, Tyler Hawkins discovers a fresh lease on life when he meets Ally Craig, a gregarious beauty who witnessed her mother\'s death. But as the couple draws closer, the fallout from their separate tragedies jeopardizes their love.','https://image.tmdb.org/t/p/w500/j7umuMiLCHvWT7wYhFKJOTFSokF.jpg','2010-04-07',7.1,0),(19191,'Starship Troopers','en','Set in the future, the story follows a young soldier named Johnny Rico and his exploits in the Mobile Infantry. Rico\'s military career progresses from recruit to non-commissioned officer and finally to officer against the backdrop of an interstellar war between mankind and an arachnoid species known as \"the Bugs\".','https://image.tmdb.org/t/p/w500/cxCmv23O7p3hyHwqoktHYkZcGsY.jpg','1997-11-07',7,0),(19192,'Upgrade','en','A brutal mugging leaves Grey Trace paralyzed in the hospital and his beloved wife dead. A billionaire inventor soon offers Trace a cure — an artificial intelligence implant called STEM that will enhance his body. Now able to walk, Grey finds that he also has superhuman strength and agility — skills he uses to seek revenge against the thugs who destroyed his life.','https://image.tmdb.org/t/p/w500/5f28TXtvHioXirX2n1XH8EJ314v.jpg','2018-05-31',7.5,0),(19193,'Brightburn','en','What if a child from another world crash-landed on Earth, but instead of becoming a hero to mankind, he proved to be something far