y Lupin, heir to a proud family line of werewolves, is in for a shock when on his 14th birthday his first \'warfing\' goes awry, turning him into a ferocious poodle.  The pack elders give Freddy until the next moonrise to prove he has the heart of a wolf, or risk being cast out forever.  With the help of an unlikely ally in a streetwise stray named Batty, Freddy must prove he\'s 100% Wolf.','https://image.tmdb.org/t/p/w500/2VrvxK4yxNCU6KVgo5TADJeBEQu.jpg','2020-06-26',6,0),(19199,'My Name Is Khan','hi','Rizwan Khan, a Muslim from the Borivali section of Mumbai, has Asperger\'s syndrome. He marries a Hindu single mother, Mandira, in San Francisco. After 9/11, Rizwan is detained by authorities at LAX who treat him as a terrorist because of his condition and his race.','https://image.tmdb.org/t/p/w500/5Y36lCiNyyV71mjq6LavgiggbhT.jpg','2010-02-10',8.1,0),(19200,'mother!','en','A couple\'s relationship is tested when uninvited guests arrive at their home, disrupting their tranquil existence.','https://image.tmdb.org/t/p/w500/2yOKarmL8B4oXaLXUdHu882SUbu.jpg','2017-09-13',7,0),(19201,'A.I. Artificial Intelligence','en','David, a robotic boy—the first of his kind programmed to love—is adopted as a test case by a Cybertronics employee and his wife. Though he gradually becomes their child, a series of unexpected circumstances make this life impossible for David. Without final acceptance by humans or machines, David embarks on a journey to discover where he truly belongs, uncovering a world in which the line between robot and machine is both vast and profoundly thin.','https://image.tmdb.org/t/p/w500/8MZSGX5JORoO72EfuAEcejH5yHn.jpg','2001-06-29',7,0),(19202,'Operation Red Sea','zh','A squad of the Jiaolong Commando Unit - Sea Dragon, a spec ops team of the Chinese Navy, carries out a hostage rescue operation in the nation of Yewaire, on the Arabian Peninsula, and fiercely fights against local rebel groups and Zaka, a terrorist organization.','https://image.tmdb.org/t/p/w500/6ctXBO0o5fKQvGdSJsPc8TAYCvp.jpg','2018-02-16',7.1,0),(19203,'Looper','en','In the futuristic action thriller Looper, time travel will be invented but it will be illegal and only available on the black market. When the mob wants to get rid of someone, they will send their target 30 years into the past where a looper, a hired gun, like Joe is waiting to mop up. Joe is getting rich and life is good until the day the mob decides to close the loop, sending back Joe\'s future self for assassination.','https://image.tmdb.org/t/p/w500/sNjL6SqErDBE8OUZlrDLkexfsCj.jpg','2012-09-26',6.9,0),(19204,'Gabriel\'s Inferno: Part IV','en','','https://image.tmdb.org/t/p/w500/qRe0HIOrNCfCf0rM9qJneFEU0s8.jpg','2022-03-30',5,0),(19205,'Motherly','en','Kate and her daughter Beth live alone in an isolated farmhouse in the woods, but when Kate slowly begins to suspect that something sinister is happening, her motherly instincts are put to the test.','https://image.tmdb.org/t/p/w500/wmh1likQEetSLIUs5MAvfWjEayY.jpg','2022-08-04',5.9,0),(19206,'Porno','en','When a group of naive teens working at a movie theater in a small Christian town discover a mysterious film hidden in its basement, they unleash an alluring succubus who gives them a sex education…written in blood.','https://image.tmdb.org/t/p/w500/1X6BxBlHqA8VdFrLwmeSiNSEpEB.jpg','2019-06-28',6.3,0),(19207,'Yes Day','en','A mom and dad who usually say no decide to say yes to their kids\' wildest requests — with a few ground rules — on a whirlwind day of fun and adventure.','https://image.tmdb.org/t/p/w500/rejrD9ovTHJbfmpLM0mbEliEPV6.jpg','2021-03-12',6.8,0),(19208,'Big Fish','en','Throughout his life Edward Bloom has always been a man of big appetites, enormous passions and tall tales. In his later years, he remains a huge mystery to his son, William. Now, to get to know the real man, Will begins piecing together a true picture of his father from flashbacks of his amazing adventures.','https://image.tmdb.org/t/p/w500/tjK063yCgaBAluVU72rZ6PKPH2l.jpg','2003-12-25',7.8,0),(19209,'The Descent: Part 2','en','Distraught, confused, and half-wild with fear, Sarah Carter emerges alone from the Appalachian cave system where she encountered unspeakable terrors. Unable to plausibly explain to the authorities what happened - or why she\'s covered in her friends\' blood - Sarah is forced back to the subterranean depths to help locate her five missing companions.','https://image.tmdb.org/t/p/w500/dOURlcw2MO0xys0Dl2NiAcUxlWA.jpg','2009-10-14',5.9,0),(19210,'Alibi.com 2','fr','After closing his agency Alibi.com and promising Flo that he would never lie to her again, Greg\'s new life became quiet, too quiet... Not for long! When he decides to propose to Flo, Greg is up against the wall and has to introduce his family. But with his crooked father and his ex-charm actress mother, this could ruin his future union. He has no choice but to reopen his agency with his former accomplices for an ultimate Alibi and to find more presentable fake parents.','https://image.tmdb.org/t/p/w500/hiMcN5jpDEeT1ZytPuNwad7XxBE.jpg','2023-02-08',7.1,0),(19211,'Megan Is Missing','en','Fourteen-year–old Megan and her best friend Amy spend a lot of time on the internet, posting videos of themselves and chatting with guys online. One night Megan chats with a guy named Josh who convinces her to meet him for a date. The next day, Megan is missing—forever. Based on actual cases of child abduction.','https://image.tmdb.org/t/p/w500/a7ndLikcqvX7dF7gsYx5iDe7qq1.jpg','2011-05-01',6.3,0),(19212,'Free Willy','en','When maladjusted orphan Jesse vandalizes a theme park, he is placed with foster parents and must work at the park to make amends. There he meets Willy, a young Orca whale who has been separated from his family. Sensing kinship, they form a bond and, with the help of kindly whale trainer Rae Lindley, develop a routine of tricks. However, greedy park owner Dial soon catches wind of the duo and makes plans to profit from them.','https://image.tmdb.or