mage.tmdb.org/t/p/w500/tq8x5F17q95T1j0up5rpzXFAylN.jpg','2023-02-10',2,0),(19218,'The Count of Monte Cristo','en','Edmond Dantés\'s life and plans to marry the beautiful Mercedes are shattered when his best friend, Fernand, deceives him. After spending 13 miserable years in prison, Dantés escapes with the help of a fellow inmate and plots his revenge, cleverly insinuating himself into the French nobility.','https://image.tmdb.org/t/p/w500/ifMgDAUXVQLY4DeOu3VTTi55jSP.jpg','2002-01-23',7.6,0),(19219,'Aquaslash','en','To celebrate their graduation, the teenagers from Valley Hills High School have organized an ’80s-themed party at the old Wet Valley water park. Things turn gruesome when it\'s revealed that a mysterious maniac has inserted giant razor blades into one of the water slides. The water park thus becomes the backdrop for a bloodbath (literally), and everyone is a suspect...','https://image.tmdb.org/t/p/w500/vb3ux1clny29nY9CtGnIbTrliHN.jpg','2019-07-29',4.2,0),(19220,'Barbie Mariposa','en','Elina, heroine of the Fairytopia films tells her friend Bibble the story of Flutterfield, a faraway kingdom populated by fairies with butterfly wings. Henna, the evil butterfly fairy has poisoned the queen of Flutterfield in an attempt to take over the kingdom.','https://image.tmdb.org/t/p/w500/qsb1OQCNVMAX3KRT6xhKOl3mM6P.jpg','2008-02-26',6.7,0),(19221,'Marlowe','en','As bad business and loneliness is taking its toll on private detective Philip Marlowe, a beautiful blonde arrives and asks him to find her ex-lover, which proves to be just a small part in a bigger mystery.','https://image.tmdb.org/t/p/w500/lSTfl5PHJFEnHPv2zPkJbN5Z83p.jpg','2023-02-15',0,0),(19222,'Hello, Goodbye, and Everything in Between','en','Clare and Aidan, who after making a pact that they would break up before college, find themselves retracing the steps of their relationship on their last evening as a couple. The epic date leads them to familiar landmarks, unexpected places, and causes them to question whether high school love is meant to last.','https://image.tmdb.org/t/p/w500/xyGsnp4Ld5PmJYYWnfuYYoENhHt.jpg','2022-07-06',6.3,0),(19223,'The Nomad','en','When a reporter filming a story about a serial killer targeting the city’s priests comes face to face with the killer, she must choose between turning him in and finishing the story or directing him towards her abusive father and finishing her own.','https://image.tmdb.org/t/p/w500/s5UZc6n7TnRU52a9gn9gW5EwGYl.jpg','2023-02-14',0,0),(19224,'Under Her Control','es','When a fashion employee thinks she will have to end her promising career after getting pregnant, her boss offers to adopt the child.','https://image.tmdb.org/t/p/w500/6AuWxKhfxDltvKMpXG4TblyBGNy.jpg','2022-04-29',5.4,0),(19225,'Percy Jackson: Sea of Monsters','en','In their quest to confront the ultimate evil, Percy and his friends battle swarms of mythical creatures to find the mythical Golden Fleece and to stop an ancient evil from rising.','https://image.tmdb.org/t/p/w500/tAu90qEpLqwqiZLsMqpaMVr55oN.jpg','2013-08-07',6,0),(19226,'Octopussy','en','James Bond is sent to investigate after a fellow “00” agent is found dead with a priceless Indian Fabergé egg. Bond follows the mystery and uncovers a smuggling scandal and a Russian General who wants to provoke a new World War.','https://image.tmdb.org/t/p/w500/yoosZitM9igSk3Sd0sBXIhKlAh1.jpg','1983-06-05',6.3,0),(19227,'Shallow Hal','en','After taking his dying father\'s advice, Hal dates only the embodiments of female physical perfection. But that all changes after Hal has an unexpected run-in with self-help guru Tony Robbins. Intrigued by Hal\'s shallowness, Robbins hypnotizes him into seeing the beauty that exists even in the least physically appealing women. Hal soon falls for Rosemary, but he doesn\'t realize that his gorgeous girlfriend is actually a 300-pound-not-so-hottie.','https://image.tmdb.org/t/p/w500/vb6CUVB3M2JgJWS1EX3ZDJQ64c0.jpg','2001-11-01',6.1,0),(19228,'The Karate Kid','en','Daniel, a fatherless teenager, arrives in Los Angeles and becomes the object of bullying by a gang of karate students when he strikes up a relationship with Ali, the gang leader’s ex-girlfriend, so Daniel asks Miyagi, a master of martial arts, to help him learn karate.','https://image.tmdb.org/t/p/w500/1mp4ViklKvA0WXXsNvNx0RBuiit.jpg','1984-06-22',7.2,0),(19229,'The King of Fighters','en','The King of Fighters movie will introduce a new science fiction spin into the setting established in the games universe by following the surviving members of three legendary fighting clans who are continually whisked away to other dimensions by an evil power. As the fighters enter each new world they battle that universes native defenders, while the force that brought them seeks to find a way to invade and infect our world.','https://image.tmdb.org/t/p/w500/qDI6PbIjeEdLUoPHGaZqDMV9Fdx.jpg','2010-08-26',5.2,0),(19230,'Nothing to Lose - Part 2','pt','Second part of the biopic of the religious leader Edir Macedo.','https://image.tmdb.org/t/p/w500/2UESbGhUBez8iu4CqVhhmpIueJh.jpg','2019-08-15',5,0),(19231,'Source Code','en','When decorated soldier Captain Colter Stevens wakes up in the body of an unknown man, he discovers he\'s part of a mission to find the bomber of a Chicago commuter train.','https://image.tmdb.org/t/p/w500/AtQDTlj3MFOXJd5C9OopaRo3rRo.jpg','2011-03-30',7.3,0),(19232,'Aladdin and the King of Thieves','en','Legendary secrets are revealed as Aladdin and his friends—Jasmine, Abu, Carpet and, of course, the always entertaining Genie—face all sorts of terrifying threats and make some exciting last-minute escapes pursuing the King Of Thieves and his villainous crew.','https://image.tmdb.org/t/p/w500/kTH7qEyvdDYMoQraQZm3LFKCge3.jpg','1996-05-20',6.3,0),(19233,'Ghostbusters','en','After losing their academic posts at a prestigious university, a team of parapsychologists goes into business as proton-pack-toting \"ghostbusters\" who exterminate ghouls, hobgoblins and supernatural pests 