e, not only exists, but was also responsible for drawing him and his four partners into a multi-million dollar heist that ended with an explosion in San Pedro harbor – leaving few survivors. Verbal lures his interrogators with an incredible story of the crime lord\'s almost supernatural prowess.','https://image.tmdb.org/t/p/w500/bUPmtQzrRhzqYySeiMpv7GurAfm.jpg','1995-07-19',8.2,0),(19239,'Marcel the Shell with Shoes On','en','Marcel is an adorable one-inch-tall shell who ekes out a colorful existence with his grandmother Connie and their pet lint, Alan. Once part of a sprawling community of shells, they now live alone as the sole survivors of a mysterious tragedy. But when a documentary filmmaker discovers them amongst the clutter of his Airbnb, the short film he posts online brings Marcel millions of passionate fans, as well as unprecedented dangers and a new hope at finding his long-lost family.','https://image.tmdb.org/t/p/w500/jaYmP4Ct8YLnxWAW2oYkUjeXtzm.jpg','2022-06-24',7.8,0),(19240,'Dad to the Rescue','es','Nicolás, one week away from getting married, receives a letter that forces him to face his best-kept secret: he is the father of a girl he only knew at birth. He only has 3 days to recover her before she goes to the adoption system.','https://image.tmdb.org/t/p/w500/5F5Hp1cvR9QfbynBmrVBV7lQeFK.jpg','2023-01-05',5,0),(19241,'Thunderbolt','cn','In order to release his kidnapped sister, sports car mechanic Jackie Chan has to beat a super-criminal street racer.','https://image.tmdb.org/t/p/w500/81D5xBlnTAdJs19dbkfw8eK0oWA.jpg','1995-09-08',6.5,0),(19242,'Oblivion','en','Jack Harper is one of the last few drone repairmen stationed on Earth. Part of a massive operation to extract vital resources after decades of war with a terrifying threat known as the Scavs, Jack’s mission is nearly complete. His existence is brought crashing down when he rescues a beautiful  stranger from a downed spacecraft. Her arrival triggers a chain of events that  forces him to question everything he knows and puts the fate of humanity in his hands.','https://image.tmdb.org/t/p/w500/2ncs7hqBsEjFMqt6Y7ShBCO9tWs.jpg','2013-04-10',6.6,0),(19243,'The 5th Wave','en','16-year-old Cassie Sullivan tries to survive in a world devastated by the waves of an alien invasion that has already decimated the population and knocked mankind back to the Stone Age.','https://image.tmdb.org/t/p/w500/37vpRkrD4OxQN0MQ7C59eszkylh.jpg','2016-01-14',5.9,0),(19244,'Grand Isle','en','Walter and his neglected wife lure a young man into their Victorian home to escape a hurricane. When the man is charged with murder by Det. Jones, he must reveal the couple\'s wicked secrets to save himself.','https://image.tmdb.org/t/p/w500/8mcXb3km7hZ8aJKpxxgnvvxt9gW.jpg','2019-12-06',5.6,0),(19245,'Lethal Weapon 2','en','In the opening chase, Martin Riggs and Roger Murtaugh stumble across a trunk full of Krugerrands. They follow the trail to a South African diplomat who\'s using his immunity to conceal a smuggling operation. When he plants a bomb under Murtaugh\'s toilet, the action explodes!','https://image.tmdb.org/t/p/w500/1EEIUw0tkX7AJZ1ikZrtKZZKlC6.jpg','1989-07-07',7,0),(19246,'Paranormal Activity 2','en','Days after welcoming a newborn baby, Dan and Kristi Rey return home one day to find their house ransacked with seemingly no explanation. Their fear forces them to put in security cameras, which begin to capture strange activity around the house.','https://image.tmdb.org/t/p/w500/gfdrkBZAyUUXJJ2iLQe03SAYRD3.jpg','2010-10-20',5.7,0),(19247,'Double Impact','en','Jean Claude Van Damme plays a dual role as Alex and Chad, twins separated at the death of their parents. Chad is raised by a family retainer in Paris, Alex becomes a petty crook in Hong Kong. Seeing a picture of Alex, Chad rejoins him and convinces him that his rival in Hong Kong is also the man who killed their parents. Alex is suspicious of Chad, especially when it comes to his girlfriend.','https://image.tmdb.org/t/p/w500/tmzw