ome of Ninjago. By night, they’re gifted warriors using their skill and awesome fleet of vehicles to fight villains and monsters. By day, they’re ordinary teens struggling against their greatest enemy....high school.','https://image.tmdb.org/t/p/w500/vUo0pNXGhp2ffTJxiStWt6fHL7F.jpg','2017-09-21',6.5,0),(19312,'Jennifer Lopez: Halftime','en','Global superstar Jennifer Lopez reflects on her multifaceted career and the pressure of life in the spotlight in this intimate documentary.','https://image.tmdb.org/t/p/w500/mPdZnmpdNYdMcMEAqUaJd4OdXHL.jpg','2022-06-08',7,0),(19313,'Barnyard','en','When the farmer\'s away, all the animals play, and sing, and dance. Eventually, though, someone has to step in and run things, a responsibility that ends up going to Otis, a carefree cow.','https://image.tmdb.org/t/p/w500/qlSCUmrflADYlCMbkviJjfujhTH.jpg','2006-08-04',5.8,0),(19314,'Conan the Barbarian','en','A film adaptation of the classic sword and sorcery hero, Conan the Barbarian. A horde of rampaging warriors massacre the parents of young Conan and enslave the young child for years on The Wheel of Pain. As the sole survivor of the childhood massacre, Conan is released from slavery and taught the ancient arts of fighting. Transforming himself into a killing machine, Conan travels into the wilderness to seek vengeance on Thulsa Doom, the man responsible for killing his family. In the wilderness, Conan takes up with the thieves Valeria and Subotai. The group comes upon King Osric, who wants the trio of warriors to help rescue his daughter who has joined Doom in the hills.','https://image.tmdb.org/t/p/w500/6alx92dvVa6RSu2JrKgbvdDvDit.jpg','1982-04-02',6.8,0),(19315,'American Beauty','en','Lester Burnham, a depressed suburban father in a mid-life crisis, decides to turn his hectic life around after developing an infatuation with his daughter\'s attractive friend.','https://image.tmdb.org/t/p/w500/wby9315QzVKdW9BonAefg8jGTTb.jpg','1999-09-15',8,0),(19316,'Ben-Hur','en','A falsely accused nobleman survives years of slavery to take vengeance on his best friend who betrayed him.','https://image.tmdb.org/t/p/w500/aUrN8UWS8d2PKLsk5teZPxrfbmO.jpg','2016-08-17',5.7,0),(19317,'Thinking XXX','en','For a book project, photographer Timothy Greenfield-Sanders took photographs of 30 stars of adult movies, each pair of photographs in the same pose, clothed and nude. This film records the photo shoots and includes interviews with the performers and commentary from eight writers (and John Waters). The actors and writers discuss economics, nudity and exhibitionism, careers, and private lives.','https://image.tmdb.org/t/p/w500/kqB0fF7VlODmw1exH4iDZHGUiVI.jpg','2004-10-27',5.4,0),(19318,'The Bourne Supremacy','en','When a CIA operation to purchase classified Russian documents is blown by a rival agent, who then shows up in the sleepy seaside village where Bourne and Marie have been living. The pair run for their lives and Bourne, who promised retaliation should anyone from his former life attempt contact, is forced to once again take up his life as a trained assassin to survive.','https://image.tmdb.org/t/p/w500/7IYGiDrquvX3q7e9PV6Pejs6b2g.jpg','2004-07-23',7.3,0),(19319,'Kung Fu Panda: Secrets of the Furious Five','en','Ordered to teach a martial arts class of rambunctious bunny kittens, Po tells stories of each of the Furious Five\'s pasts.','https://image.tmdb.org/t/p/w500/tv52mGWtf13T3XEQj3Heow1whuc.jpg','2008-11-08',6.7,0),(19320,'Why Women Cheat','en','The male lead is the king of a small island nation. He was previously badly hurt by the female lead. The female lead has a canine tooth that makes her look extremely captivating when she smiles. When the female lead vanished, the male lead became extremely fond of sleeping because he did not want to miss her. As fate would have it, the male lead married the female lead in the end. He decided to properly torment that adorable yet horrible woman for a while','https://image.tmdb.org/t/p/w500/xHJhH0pGTFLsECDry3G170M8fsG.jpg','2021-07-06',2.8,0),(19321,'Romeo + Juliet','en','In director Baz Luhrmann\'s contemporary take on William Shakespeare\'s classic tragedy, the Montagues and Capulets have moved their ongoing feud to the sweltering suburb of Verona Beach, where Romeo and Juliet fall in love and secretly wed. Though the film is visually modern, the bard\'s dialogue remains.','https://image.tmdb.org/t/p/w500/zWLZEUE0jrTiLhWQVh8NOJRwIU9.jpg','1996-11-01',6.8,0),(19322,'Twelve Monkeys','en','In the year 2035, convict James Cole reluctantly volunteers to be sent back in time to discover the origin of a deadly virus that wiped out nearly all of the earth\'s population and forced the survivors into underground communities. But when Cole is mistakenly sent to 1990 instead of 1996, he\'s arrested and locked up in a mental hospital. There he meets psychiatrist Dr. Kathryn Railly, and patient Jeffrey Goines, the son of a famous virus expert, who may hold the key to the mysterious rogue group, the Army of the 12 Monkeys, thought to be responsible for unleashing the killer disease.','https://image.tmdb.org/t/p/w500/gt3iyguaCIw8DpQZI1LIN5TohM2.jpg','1995-12-29',7.6,0),(19323,'The Lover','fr','A poor French teenage girl engages in an illicit affair with a wealthy Chinese heir in 1920s Saigon. For the first time in her young life she has control, and she wields it deftly over her besotted lover throughout a series of clandestine meetings and torrid encounters.','https://image.tmdb.org/t/p/w500/lgBGy8QaIFD9jQJWgi837czobEp.jpg','1992-01-22',7,0),(19324,'The Day After Tomorrow','en','After years of increases in the greenhouse effect,  havoc is wreaked globally in the form of catastrophic hurricanes, tornadoes, tidal waves, floods and the beginning of a new Ice Age. Paleoclimatologist, Jack Hall tries to warn the world while also shepherding to safety his son, trapped in New York after the city is overwhelmed by the start of the new big freeze.','https://image.tmdb.org/t/p/w500/kNKy8eJemg6sCA