n to a provisional quarantine facility, a high-security installation where she will have to stay in isolation for several days. An old oil tanker, miles off shore and surrounded by water on all sides, has been especially equipped for the quarantine.','https://image.tmdb.org/t/p/w500/sD6LX35RwyDzMDAunn89MBZFnFv.jpg','2014-10-31',5.6,0),(19331,'I Am Sam','en','Sam, a neurodivergent man, has a daughter with a homeless woman who abandons them when they leave the hospital, leaving Sam to raise Lucy on his own. But as Lucy grows up, Sam\'s limitations as a parent start to become a problem and the authorities take her away. Sam convinces high-priced lawyer Rita to take his case pro bono and in turn teaches her the value of love and family.','https://image.tmdb.org/t/p/w500/wSgAn3zhgwuTOhhvvqcdxVqTLts.jpg','2001-12-28',7.6,0),(19332,'Tyler Perry\'s A Madea Homecoming','en','Madea\'s back - hallelujer! And she\'s not putting up with any nonsense as family drama erupts at her great-grandson\'s college graduation celebration.','https://image.tmdb.org/t/p/w500/lOGPhJ5hrvcRFernsAfuwdiqwur.jpg','2022-02-25',6.9,0),(19333,'The Mermaid','zh','A playboy business tycoon, Liu Xuan, purchases the Green Gulf, a wildlife reserve, for a sea reclamation project, and uses sonar technology to get rid of the sea life in the area. Unknown to him, the Green Gulf is the home of merpeople, and the sonar has caused many of them to succumb to illness or die. Xuan\'s business ventures in the area are threatened when he crosses paths with the mermaid, Shan, who is sent to avenge her people.','https://image.tmdb.org/t/p/w500/8YVB8VxQqx3J1FtOVvoHybBKNPS.jpg','2016-02-08',6.4,0),(19334,'Gnomeo & Juliet','en','A version of Shakespeare\'s play, set in the world of warring indoor and outdoor gnomes. Garden gnomes Gnomeo and Juliet have as many obstacles to overcome as their quasi namesakes when they are caught up in a feud between neighbors. But with plastic pink flamingos and lawnmower races in the mix, c