uy and Elvira Mistress of the Dark, to solve this mystery of gigantic proportions and save Crystal Cove!','https://image.tmdb.org/t/p/w500/5aL71e0XBgHZ6zdWcWeuEhwD2Gw.jpg','2020-10-06',7.9,0),(19346,'Justice League: Gods and Monsters','en','In an alternate universe, very different versions of DC\'s Trinity fight against the government after they are framed for an embassy bombing.','https://image.tmdb.org/t/p/w500/9EoqQuEZKmQIYjexoUbkxMcMCVr.jpg','2015-06-18',7.1,0),(19347,'Tad the Lost Explorer and the Secret of King Midas','es','Tad dreams of becoming an archaeologist traveling the world, uncovering hidden secrets and lost treasure, but his job working construction keeps him daydreaming instead of exploring. The chance of a lifetime comes when he is invited to attend archaeologist Sara Lavrof\'s presentation of her latest discovery - the papyrus that proves the existence of the Necklace of Midas, the legendary King who turned everything he touched into solid gold.','https://image.tmdb.org/t/p/w500/7WtFoWtGp45PLNmajM8iGtjAA7B.jpg','2017-03-25',6.6,0),(19348,'Paddington 2','en','Paddington, now happily settled with the Browns, picks up a series of odd jobs to buy the perfect present for his Aunt Lucy, but it is stolen.','https://image.tmdb.org/t/p/w500/1OJ9vkD5xPt3skC6KguyXAgagRZ.jpg','2017-11-09',7.5,0),(19349,'Meet the Spartans','en','The heroic Leonidas, armed with nothing but leather underwear and a cape, leads a ragtag group of 13 Spartans to defend their homeland against the invading Persians (whose ranks include Ghost Rider, Rocky Balboa, the Transformers, and a hunchbacked Paris Hilton). No one is safe when the Spartans take on the biggest icons in pop culture!','https://image.tmdb.org/t/p/w500/DWQOjAPvM8Kk1Qp3Xq0zae0Z6w.jpg','2008-01-24',4,0),(19350,'Against the Ice','en','In 1909, two explorers fight to survive after they\'re left behind while on a Denmark expedition in ice-covered Greenland.','https://image.tmdb.org/t/p/w500/6FSGYvPEhIx3ThOikGqHmKxeyNN.jpg','2022-02-10',6.8,0),(19351,'Tall Girl','en','Jodi, the tallest girl in her high school, has always felt uncomfortable in her own skin. But after years of slouching, being made fun of, and avoiding attention at all costs, Jodi finally decides to find the confidence to stand tall.','https://image.tmdb.org/t/p/w500/m0clsFEXidLVJ0TueqWOvvImOMh.jpg','2019-09-13',6.4,0),(19352,'Scent of a Woman','en','Charlie Simms is a student at a private preparatory school who comes from a poor family. To earn the money for his flight home to Gresham, Oregon for Christmas, Charlie takes a job over Thanksgiving looking after retired U.S. Army officer Lieutenant Colonel Frank Slade, a cantankerous middle-aged man who lives with his niece and her family.','https://image.tmdb.org/t/p/w500/j4fDIiv0N78Sfp9Wn0BaYzbIj1B.jpg','1992-12-23',7.8,0),(19353,'Soul Surfer','en','The true story of teen surfer Bethany Hamilton, who lost her arm in a shark attack and courageously overcame all odds to become a champion again, through her sheer determination and unwavering faith.','https://image.tmdb.org/t/p/w500/urLCQDCOITabAud39ZwLbNFBrc4.jpg','2011-04-08',7,0),(19354,'Spider-Man 2','en','Peter Parker is going through a major identity crisis. Burned out from being Spider-Man, he decides to shelve his superhero alter ego, which leaves the city suffering in the wake of carnage left by the evil Doc Ock. In the meantime, Parker still can\'t act on his feelings for Mary Jane Watson, a girl he\'s loved since childhood. A certain anger begins to brew in his best friend Harry Osborn as well...','https://image.tmdb.org/t/p/w500/olxpyq9kJAZ2NU1siLshhhXEPR7.jpg','2004-06-25',7.2,0),(19355,'Friday the 13th Part 2','en','Five years after the horrible bloodbath at Camp Crystal Lake, it seems Jason Voorhees and his demented mother are in the past. Paul opens up a new camp close to the infamous site, ignoring warnings to stay away, and a sexually-charged group of counselors follow -- including child psychologist major