emories that allow him to relive the adventures of his ancestor in 15th century Spain, Callum Lynch discovers he\'s a descendant of the secret \'Assassins\' society. After gaining incredible knowledge and skills, he is now poised to take on the oppressive Knights Templar in the present day.','https://image.tmdb.org/t/p/w500/ne5LmY2zq2dTG8TDGJOrCB4IbRy.jpg','2016-12-21',5.4,0),(19361,'Vertigo','en','A retired San Francisco detective suffering from acrophobia investigates the strange activities of an old friend\'s wife, all the while becoming dangerously obsessed with her.','https://image.tmdb.org/t/p/w500/15uOEfqBNTVtDUT7hGBVCka0rZz.jpg','1958-05-28',8.2,0),(19362,'Rubius X','es','On the 10th anniversary of the publication of his first video on the Internet, \"Rubius X\" is a documentary that deals with the origin, motivation and secrets behind Rubius, one of the most followed Spanish content creators in the world. A review of the history of a pioneer, the icon of a whole generation, who represents like few others the revolution of the new digital media.','https://image.tmdb.org/t/p/w500/k6KAAVebtdVb0FRU2PWqYLnhgRA.jpg','2022-07-21',8.5,0),(19363,'Spy Kids 2: The Island of Lost Dreams','en','Exploring the further adventures of Carmen and Juni Cortez, who have now joined the family spy business as Level 2 OSS agents. Their new mission is to save the world from a mad scientist living on a volcanic island populated by an imaginative menagerie of creatures. On this bizarre island, none of the Cortez\'s gadgets work and they must rely on their wits--and each other--to survive and save the day.','https://image.tmdb.org/t/p/w500/A6gkSQVkbUiSCq7C9kexlJF8GdI.jpg','2002-08-07',5.6,0),(19364,'Shottas','en','A raw urban drama about two friends raised on the dangerous streets of Kingston, Jamaica. Biggs and Wayne take on the \"Shotta\" way of life to survive. As young boys, they begin a life of crime, eventually moving to the US where they begin a ruthless climb from the bottom. 