n Gruffudd)—are forced to radically alter plans.  With dwindling supplies, the crew must navigate an underwater labyrinth to make it out.  Soon, they are confronted with the unavoidable question: Can they survive, or will they be trapped forever?','https://image.tmdb.org/t/p/w500/zRUNv1CbeVtmTCNr6RLHnxV2QYm.jpg','2011-02-03',6,0),(19370,'Alcarràs','ca','For as long as they can remember, the Solé family has spent every summer picking the peaches in their orchard in Alcarràs, a small village in Catalonia. But this year’s crop may well be their last, as they face eviction. The new plans for the land, which include cutting down the peach trees and installing solar panels, cause a rift in this large, tight-knit family. For the first time, they face an uncertain future and risk losing more than their orchard.','https://image.tmdb.org/t/p/w500/93eceHkP3bTTGhrERgL6nKdYgNG.jpg','2023-01-06',6.6,0),(19371,'Constantine: City of Demons - The Movie','en','A decade after a tragic mistake, family man Chas and occult detective John Constantine set out to cure Chas’s daughter Trish from a mysterious supernatural coma. With the help of the mysterious Nightmare Nurse, the influential Queen of Angels, and brutal Aztec God Mictlantecuhtli, the pair just might have a chance at outsmarting the demon Beroul to save Trish’s soul. In a world of shadows and dark magic, not everything is what it seems, and there’s always a price to pay. The path to redemption is never easy, and if Constantine is to succeed, he must navigate through the dark urban underbelly of Los Angeles, outwit the most cunning spawns of hell, and come face to face with arch-nemesis Nergal – all while battling his own inner demons!','https://image.tmdb.org/t/p/w500/tZIMe2pYug1cS9e7AZnd1bTTidM.jpg','2018-10-04',7.8,0),(19372,'S.W.A.T.','zh','The story centers on the Chinese Special Police Unit, from their hard training to their first mission.','https://image.tmdb.org/t/p/w500/wFklu01YHWhp2MxljR8e3XyvpPp.jpg','2019-12-29',7.5,0),(19373,'Hidden Desire','cn','David is sitting in a bar, musing over why he has bedded and left five or six of Asia\'s loveliest women in such a short time.','https://image.tmdb.org/t/p/w500/39cD7X07Nrt3wsEqcYP1n9BhjX2.jpg','1991-11-15',4,0),(19374,'Scooby-Doo! and the Reluctant Werewolf','en','Shaggy is turned into a werewolf, and it\'s up to Scooby, Scrappy and Shaggy\'s girlfriend to help him win a race against other monsters, and become human again.','https://image.tmdb.org/t/p/w500/cXUQuHnNBxFSZAmYfogMfrcvMk7.jpg','1988-11-13',7.4,0),(19375,'Confessions of a Hitman','fr','A paid assassin working for the biker gangs of Quebec outsmarts both the police and the underworld for decades, committing 28 hits over 25 years.','https://image.tmdb.org/t/p/w500/sFGkKtWq9rvb7AriX39369FRssP.jpg','2022-07-20',7.2,0),(19376,'That Malicious Age','it','Gardener Nino Castellano takes a job in a southern-Italian villa and quickly finds himself embroiled in a menage-a-trois with Gloria Guida and Anita Sanders which soon leads to sex, death and mayhem!','https://image.tmdb.org/t/p/w500/xtLYENqy9UvMFHuTe5YTyr4ipup.jpg','1975-03-11',6.6,0),(19377,'Lawrence of Arabia','en','The story of British officer T.E. Lawrence\'s mission to aid the Arab tribes in their revolt against the Ottoman Empire during the First World War. Lawrence becomes a flamboyant, messianic figure in the cause of Arab unity but his psychological instability threatens to undermine his achievements.','https://image.tmdb.org/t/p/w500/AiAm0EtDvyGqNpVoieRw4u65vD1.jpg','1962-12-11',8,0),(19378,'A Perfect Murder','en','Millionaire industrialist Steven Taylor is a man who has everything but what he craves most: the love and fidelity of his wife. A hugely successful player in the New York financial world, he considers her to be his most treasured acquisition. But she needs more than simply the role of dazzling accessory.','https://image.tmdb.org/t/p/w500/wC0ax12N9GQ8vMXPEs4nES5AAiB.jpg','1998-06-05',6.5,0),(19379,'Savages','