itage, to restore balance.  Living with powers he doesn’t understand and seeing the danger around him, Curry takes steps to embrace his destiny, joining the Justice League, and with his new teammates he battles to save Earth from total destruction.','https://image.tmdb.org/t/p/w500/wjD6lr6vi9DIwwyDZaOjGpIbulu.jpg','2015-01-27',7,0),(19385,'Sitio Diablo','tl','A story about a gangster couple who returns to Sitio Diablo, a gangland in Manila, and form a new gang, Illustrados. A bloodbath is set to happen when they face their old gang, Los Hijos Diablos who rules Sitio Diablo.','https://image.tmdb.org/t/p/w500/s4oOLgH5zcwlaQHmHY5diSwiPVO.jpg','2022-08-26',4.7,0),(19386,'Christmas Unfiltered','en','A teen who feels ignored by her family makes a Christmas wish to be listened to, then wakes up and discovers she can only tell the whole truth.','https://image.tmdb.org/t/p/w500/gVx7g8YkrjDVF62zMFGMxyjExen.jpg','2022-12-01',6.3,0),(19387,'Yu Pui Tsuen','cn','','https://image.tmdb.org/t/p/w500/9pHrUSweNaglwTy2s81fWtBGerU.jpg','1986-12-12',4,0),(19388,'Nix','en','When a mysterious entity manifests itself, a family finds themselves on a scary and dark journey into their own self-created madness.','https://image.tmdb.org/t/p/w500/pmAFOmkhsTXJlRptAgoKn77Odue.jpg','2022-09-27',7.6,0),(19389,'The Expendables 4','en','The fourth film in The Expendables franchise.','https://image.tmdb.org/t/p/w500/6eEFJTQTkoNmR41Fj6OnZOcT4u4.jpg','2023-09-22',0,0),(19390,'Hard Target 2','en','Forced into a deadly cat-and-mouse game, a disgraced mixed martial arts fighter is hunted through the jungles of Southeast Asia.','https://image.tmdb.org/t/p/w500/jO8C2AIIdFyi5ceI6whev0RYt0k.jpg','2016-07-14',6.1,0),(19391,'Catherine Called Birdy','en','A teenage girl in Medieval England navigates life and tries to avoid the arranged marriages her father maps out for her.','https://image.tmdb.org/t/p/w500/a6welBP7DtjHDsr6fwT5IuCS33f.jpg','2022-09-23',6.1,0),(19392,'Bitter Moon','en','A passenger on a cruise ship 