Gqdu.jpg','2005-12-05',6.4,0),(19406,'Artemis Fowl','en','Artemis Fowl is a 12-year-old genius and descendant of a long line of criminal masterminds. He soon finds himself in an epic battle against a race of powerful underground fairies who may be behind his father\'s disappearance.','https://image.tmdb.org/t/p/w500/tI8ocADh22GtQFV28vGHaBZVb0U.jpg','2020-06-12',5.6,0),(19407,'The Other Side of Heaven 2: Fire of Faith','en','Missionary John H. Groberg returns to Tonga in the 1960s with his wife and their five young daughters. When their sixth child is born with a serious illness, the Grobergs face their ultimate test of faith, only to find themselves surrounded by the love and prayers of thousands of Tongans. Barriers of inter religious strife are soon broken down as all unite in hopes of a miracle that will save the baby\'s life, as well as the life of a Tongan minister\'s son.','https://image.tmdb.org/t/p/w500/lh0BwrB7ZC2fcMvYu2TBXpY1nsM.jpg','2019-06-28',5.4,0),(19408,'Valentine\'s Day','en','More than a dozen Angelenos navigate Valentine\'s Day from early morning until midnight. Three couples awake together, but each relationship will sputter. A grade-school boy wants flowers for his first true love. Two high school seniors plan first-time sex at noon. A TV sports reporter gets the assignment to find romance in LA. A star quarterback contemplates his future. Two strangers meet on a plane. Grandparents, together for years, face a crisis. An \'I Hate Valentine\'s Day\' dinner beckons the lonely and the lied to.','https://image.tmdb.org/t/p/w500/qOTcfD2DdnOTmhH0r1TOE09VvNh.jpg','2010-02-10',5.9,0),(19409,'The Secret Life of Walter Mitty','en','A timid magazine photo manager who lives life vicariously through daydreams embarks on a true-life adventure when a negative goes missing.','https://image.tmdb.org/t/p/w500/tY6ypjKOOtujhxiSwTmvA4OZ5IE.jpg','2013-12-18',7.2,0),(19410,'Nightride','en','In this single shot thriller, we\'re in the driver\'s seat with small-time dealer Budge as he tries to pull one last deal with cash borrowed from a dangerous loan shark. When the handover goes catastrophically wrong, Budge finds himself in a race against time to find his missing product and get a new buyer before the loan shark tracks him down.','https://image.tmdb.org/t/p/w500/w8WILe0aNn4QhiNQA0hIFltuti9.jpg','2022-03-04',6.6,0),(19411,'The Scorpion King 3: Battle for Redemption','en','Since his triumphant rise to power in the original blockbuster \"The Scorpion King\", Mathayus\' kingdom has fallen and he\'s lost his queen to plague. Now an assassin for hire, he must defend a kingdom from an evil tyrant and his ghost warriors for the chance to regain the power and glory he once knew. Starring Ron Perlman (\"Hellboy\") and Billy Zane (\"Titanic\"), and featuring 6-time WWE champion Dave Bautista and UFC star Kimbo Slice, \"The Scorpion King 3: Battle for Redemption\" takes \"The Mummy\" phenomenon to an all-new level of epic action and non-stop adventure.','https://image.tmdb.org/t/p/w500/z1fab9fVsIV35K21ictA4GYTicI.jpg','2012-01-17',4.5,0),(19412,'An American Werewolf in London','en','Two American tourists in England are attacked by a werewolf that none of the locals will admit exists.','https://image.tmdb.org/t/p/w500/hVEqUASJmCQaolkKFEySCHZ8uKG.jpg','1981-08-21',7.4,0),(19413,'Back to the Future Part III','en','The final installment of the Back to the Future trilogy finds Marty digging the trusty DeLorean out of a mineshaft and looking for Doc in the Wild West of 1885. But when their time machine breaks down, the travelers are stranded in a land of spurs. More problems arise when Doc falls for pretty schoolteacher Clara Clayton, and Marty tangles with Buford Tannen.','https://image.tmdb.org/t/p/w500/crzoVQnMzIrRfHtQw0tLBirNfVg.jpg','1990-05-25',7.5,0),(19414,'Deepwater Horizon','en','A story set on the offshore drilling rig Deepwater Horizon, which exploded during April 2010 and created the worst oil spill in U.S. history.','https://image.tmdb.org/t/p/w500/jgBIYCZACe3iaS9TL2XzVGkO5p5.jpg','2016-09-28',6.8,0),(19415,'Dark Shadows','en','Vampire Barnabas Collins is inadvertently freed from his tomb and emerges into the very changed world of 1972. He returns to Collinwood Manor to find that his once-grand estate and family have fallen into ruin.','https://image.tmdb.org/t/p/w500/fd9Ck4cxVlmtXsbeGtQW7WFuUFI.jpg','2012-05-09',6,0),(19416,'Odd Thomas','en','In a California desert town, a short-order cook with clairvoyant abilities encounters a mysterious man with a link to dark, threatening forces.','https://image.tmdb.org/t/p/w500/skBMhQjHLTU1rp4gutxHp0JuY1C.jpg','2013-01-29',6.9,0),(19417,'A Goofy Movie','en','Though Goofy always means well, his amiable cluelessness and klutzy pratfalls regularly embarrass his awkward adolescent son, Max. When Max\'s lighthearted prank on his high-school principal finally gets his longtime crush, Roxanne, to notice him, he asks her on a date. Max\'s trouble at school convinces Goofy that he and the boy need to bond over a cross-country fishing trip like the one he took with his dad when he was Max\'s age, which throws a kink in his son\'s plans to impress Roxanne.','https://image.tmdb.org/t/p/w500/bycmMhO3iIoEDzP768sUjq2RV4T.jpg','1995-04-07',7,0),(19418,'The Ant Bully','en','Fed up with being targeted by the neighborhood bully, 10-year-old Lucas Nickle vents his frustrations on the anthill in his front yard ... until the insects shrink him to the size of a bug with a magic elixir. Convicted of \"crimes against the colony,\" Lucas can only regain his freedom by living with the ants and learning their ways.','https://image.tmdb.org/t/p/w500/oFuqX0inTvbA1XAFv2x3CQnI65m.jpg','2006-07-28',5.7,0),(19419,'Titanic','de','This little-known German film retells the true story of the British ocean liner that met a tragic fate. Ernst Fritz Fürbringer plays the president of the White Star Line, who unwisely pressed the Titanic\'s captain (Otto Wernicke) to make the swiftest possible crossing to New York.','https://image.tmdb.org/t/p/w500/Al7oIXQ4dZAofBTZWm6OiXS3MEa.jpg','1943-11-10',6.1,0),(19420,'Home Team','en','Two years after a Super Bowl win when NFL head coach Sean Payton is suspended, he goes back to his hometown and finds himself reconnecting with his 12-year-old son by coaching his Pop Warner football team.','https://image.tmdb.org/t/p/w500/zTwfMV1hm1DIrMo8BGyZKskhSPr.jpg','2022-01-28',6.8,0),(19421,'Scooby-Doo 2: Monsters Unleashed','en','When Mystery, Inc. are guests of honor at the grand opening of the Coolsville Museum of Criminology, a masked villain shows up and creates havoc before stealing the costumes of the gang\'s most notorious villains...Could it be that their nemesis, mad scientist Jonathan Jacobo has returned and is trying to recreate their deadliest foes?','https://image.tmdb.org/t/p/w500/uSXcvO5oZSBZkQSFVzNSEn4JteB.jpg','2004-03-24',6,0),(19422,'House of the Witch','en','A group of high-school kids set out to play a Halloween prank at an abandoned house, but once they enter they become victims of a demonic witch who has set her wrath upon them.','https://image.tmdb.org/t/p/w500/cg6xjZOnGsYYqC7SH3o8oJV9Vr1.jpg','2017-10-07',4.7,0),(19423,'Jason Bourne','en','The most dangerous former operative of the CIA is drawn out of hiding to uncover hidden truths about his past.','https://image.tmdb.org/t/p/w500/xA7N41glw17MBQtcWSm2eBlBRuG.jpg','2016-07-27',6.3,0),(19424,'Confessions of a Shopaholic','en','In the glamorous world of New York City, Rebecca Bloomwood is a fun-loving girl who is really good at shopping - a little too good, perhaps. She dreams of working for her favorite fashion magazine, but can\'t quite get her foot in the door - until ironically, she snags a job as an advice columnist for a financial magazine published by the same company.','https://image.tmdb.org/t/p/w500/6DH1iP06fcpjD7tppsTwcAyZfDR.jpg','2009-02-05',6.4,0),(19425,'AI Love You','th','A modern love story set in the near future where an AI building is powered by human feelings. Due to a software glitch, it falls in love with a real girl, escapes the building into the body of a real man, and tries to win her affections.','https://image.tmdb.org/t/p/w500/sBiJOvHCSWORnFpc4yItflIkdTi.jpg','2022-02-15',6,0),(19426,'Huevos: Little Rooster\'s Egg-Cellent Adventure','es','Toto has grown and now is a young cock. An evil rancher tricks the female owner of the ranch where they live and forces her to bet the property in a cockfight in the arena. Toto is the only option to defend their home, so he must train in just one week and win the championship of the arena.','https://image.tmdb.org/t/p/w500/e55ZEtyXkknzBgNmrcyTICAG3gA.jpg','2015-09-04',7,0),(19427,'X','en','A veteran call girl and a runaway prostitute witness a murder which sends them on an out-of-control roller coaster ride through the twilight zone of sex-for-sale.','https://image.tmdb.org/t/p/w500/nvU6uTwSpMpitM6mnuYXb1LgxxX.jpg','2011-11-23',6.5,0),(19428,'South Park: Post COVID: The Return of COVID','en','If Stan, Kyle and Cartman could just work together, they could go back in time to make sure Covid never happened. But traveling back to the past seems to be the easy answer until they meet Victor Chaos.','https://image.tmdb.org/t/p/w500/xD88mrJ8hsqYVqQ6kinNNGQLdg1.jpg','2021-12-16',7.4,0),(19429,'The Christmas Chronicles: Part Two','en','Kate Pierce is reluctantly spending Christmas with her mom’s new boyfriend and his son Jack. But when the North Pole and Christmas are threatened to be destroyed, Kate and Jack are unexpectedly pulled into a new adventure with Santa Claus.','https://image.tmdb.org/t/p/w500/6sG0kbEvAi3RRLcGGU5h8l3qAPa.jpg','2020-11-18',6.5,0),(19430,'Turbo','en','The tale of an ordinary garden snail who dreams of winning the Indy 500.','https://image.tmdb.org/t/p/w500/inTKQni4YW8syrfgnXHwzmNeSo4.jpg','2013-07-11',6.2,0),(19431,'Greyhound','en','A first-time captain leads a convoy of allied ships carrying thousands of soldiers across the treacherous waters of the “Black Pit” to the front lines of WW2. With no air cover protection for 5 days, the captain and his convoy must battle the surrounding enemy Nazi U-boats in order to give the allies a chance to win the war.','https://image.tmdb.org/t/p/w500/kjMbDciooTbJPofVXgAoFjfX8Of.jpg','2020-07-10',7.4,0),(19432,'Upon the Magic Roads','ru','Romantic John the Fool and his friend Foal set out on a series of unpredictable adventures in different magical worlds. The two buddies will have to outsmart an evil tyrant king, catch the firebird, and find John’s true love.','https://image.tmdb.org/t/p/w500/eF66ncsrVgVX0Js5xGezRCapTjD.jpg','2021-02-18',6.6,0),(19433,'The Game Plan','en','Bachelor football star Joe Kingman seems to have it all. He is wealthy and carefree, and his team is on the way to capturing a championship. Suddenly, he is tackled by some unexpected news: He has a young daughter, the result of a last fling with his ex-wife. Joe must learn to balance his personal and professional lives with the needs of his child.','https://image.tmdb.org/t/p/w500/fcLFvIqCUrhY96mkSmr3okxaMEw.jpg','2007-09-28',6.4,0),(19434,'Austin Powers: The Spy Who Shagged Me','en','When diabolical genius Dr. Evil travels back in time to steal superspy Austin Powers\'s ‘mojo,’ Austin must return to the swingin\' \'60s himself - with the help of American agent, Felicity Shagwell - to stop the dastardly plan. Once there, Austin faces off against Dr. Evil\'s army of minions to try to save the world in his own unbelievably groovy way.','https://image.tmdb.org/t/p/w500/f2ohIBEbc3eERyU5pgSknm8DqUj.jpg','1999-06-08',6.3,0),(19435,'Tooth Fairy','en','When minor-league hockey player Derek Thompson -- who has a penchant for knocking out his opponents\' teeth every time he plays -- disillusions a fan, he is sentenced to a stint for one week as a bona fide, tutu-clad, real-life tooth fairy. Soon, Derek is inspired to rekindle his youthful dreams.','https://image.tmdb.org/t/p/w500/cRZvw3bPomtucIUtMHZ3qPIYtYs.jpg','2010-01-14',5.5,0),(19436,'The Corpse of Anna Fritz','es','Anna Fritz is a beautiful and famous actress. Suddenly her body is found in a hotel and the news of her death goes around the planet. The young, shy caretaker Pau works at the hospital where they carried the body of Anna Fritz. He and his friends  decide to take pictures of the body of Anna Fritz.  They decide they could make love to her and nobody would know. They are in front of Anna Fritz ... and can do with it what  they want.','https://image.tmdb.org/t/p/w500/A4FBEaJsdu5n4srYJyCI7v32lLY.jpg','2015-03-15',6.9,0),(19437,'The Untold Story 2','cn','The blood flows freely in this sequel to the first Untold Story, which now finds Anthony Wong Chau-Sang in a different role; in a film that is just as violent and frightening as the original. An unhappily married couple invite the wife\'s beautiful cousin, who has survived a horrifying experience in Mainland China, to live with them. She has her own special way of overcoming hardship and becomes the master of the barbecue','https://image.tmdb.org/t/p/w500/nLGPHeC3T1HdUio3FU6M9ScvatQ.jpg','1998-04-25',4.9,0),(19438,'Invasion','ru','Two years after the fall of the alien ship, the life of a young woman from Moscow has been changed forever. Her growing powers are now at the focus of both human and celestial investigation: an alien force takes an interest in her, and will stop short of nothing, including an invasion. Can love and compassion save humanity, when faced with a much greater and more demanding test this time?','https://image.tmdb.org/t/p/w500/dqKqzcdhtJwOhjqe89RTURqILtl.jpg','2020-01-01',6.9,0),(19439,'Cloud Atlas','en','A set of six nested stories spanning time between the 19th century and a distant post-apocalyptic future. Cloud Atlas explores how the actions and consequences of individual lives impact one another throughout the past, the present and the future. Action, mystery and romance weave through the story as one soul is shaped from a killer into a hero and a single act of kindness ripples across centuries to inspire a revolution in the distant future.  Based on the award winning novel by David Mitchell. Directed by Tom Tykwer and the Wachowskis.','https://image.tmdb.org/t/p/w500/ereKZnGS7sVoPvu7lhZL2B4ZYFq.jpg','2012-10-26',6.9,0),(19440,'Barbie: The Princess & The Popstar','en','Tori is a blonde princess who is bored of living her royal life, and has dreams of becoming a popstar. Keira, on the other hand, is a brunette popstar who dreams of being a princess. When the two meet, they magically trade places, but after realising it is best to be themselves.','https://image.tmdb.org/t/p/w500/hab6ZMC3eXj9pQHlSxNUjonphCR.jpg','2012-09-13',7.1,0),(19441,'Diary of a Wimpy Kid','en','Greg Heffley is headed for big things, but first he has to survive the scariest, most humiliating experience of any kid’s life – middle school! That won’t be easy, considering he’s surrounded by hairy-freckled morons, wedgie-loving bullies and a moldy slice of cheese with nuclear cooties!','https://image.tmdb.org/t/p/w500/iLAGiPnSuODt9cn332bkFElrRig.jpg','2010-03-19',6.2,0),(19442,'Yesterday','en','Jack Malik is a struggling singer-songwriter in an English seaside town whose dreams of fame are rapidly fading, despite the fierce devotion and support of his childhood best friend, Ellie. After a freak bus accident during a mysterious global blackout, Jack wakes up to discover that he\'s the only person on Earth who can remember The Beatles.','https://image.tmdb.org/t/p/w500/1rjaRIAqFPQNnMtqSMLtg0VEABi.jpg','2019-06-27',6.7,0),(19443,'Satanic Pandemonium','es','Sister Maria is known in the convent for her good works and charity, but, in the secret depths of her sexual fantasies, she is tormented by visions of another world - a world where her forbidden passions are allowed to run free. In this world Satan is her master. As her acts of violence and blasphemy mount, Maria realizes that she has been chosen by the Devil to destroy the convent and lead her sister nuns into hell!','https://image.tmdb.org/t/p/w500/k6LZn3greNmaYhySVnwUkkDmlpo.jpg','1975-06-26',6.6,0),(19444,'2 Hearts','en','When illness strikes two people who are polar opposites, life and death bring them together in surprising ways.','https://image.tmdb.org/t/p/w500/a7bW3uKOMPBnmHs8gnlpfhTD8YQ.jpg','2020-10-16',7.5,0),(19445,'I Can Only Imagine','en','10-year-old Bart Millard lives with his mother and abusive father Arthur in Texas. One day his mother drops him off at a Christian camp where he meets Shannon. Upon his return from camp, Bart finds his mother has left and movers are removing her belongings. He angrily confronts his father, who denies that his abusiveness was the reason she left. Years later, in high school, Bart and Shannon are dating. Bart plays football to please his father but is injured, breaking both ankles and ending his career. The only elective with openings is music class, so he reluctantly signs up.','https://image.tmdb.org/t/p/w500/veZszwMZu8d3WMU6TJX9sV5w1Y4.jpg','2018-02-14',7.5,0),(19446,'Along for the Ride','en','The summer before college, Auden meets the mysterious Eli, a fellow insomniac. While the seaside town of Colby sleeps, the two embark on nightly quests to help Auden experience the fun, carefree teen life she never knew she wanted.','https://image.tmdb.org/t/p/w500/d5spmLeGR9kxBRQ6qxCFad1ljvT.jpg','2022-05-04',6.8,0),(19447,'The Bad Seed Returns','en','Several years after the murderous events of the first movie left her father dead, Emma is now living with her aunt Angela and navigating high school. Angela’s husband begins to suspect that Emma may not be as innocent as she appears and suggests sending her off to boarding school. Meanwhile, a new girl at school seems to know Emma’s secrets, leaving Emma no choice but to slip back to her old ways and take care of her enemies by any means necessary.','https://image.tmdb.org/t/p/w500/n7gVho5g4IFqnbBJL8ATqG53UH4.jpg','2022-09-05',7.2,0),(19448,'Child\'s Play','en','Karen, a single mother, gifts her son Andy a Buddi doll for his birthday, unaware of its more sinister nature. A contemporary re-imagining of the 1988 horror classic.','https://image.tmdb.org/t/p/w500/rpS7ROczWulqfaXG2klYapULXKm.jpg','2019-06-19',6,0),(19449,'The Worst Person in the World','no','The chronicles of four years in the life of Julie, a young woman who navigates the troubled waters of her love life and struggles to find her career path, leading her to take a realistic look at who she really is.','https://image.tmdb.org/t/p/w500/p5nLFV9aa76zhFK91Qi0xRlXvQ1.jpg','2021-10-13',7.6,0),(19450,'Scary Stories to Tell in the Dark','en','Mill Valley, Pennsylvania, Halloween night, 1968. After playing a joke on a school bully, Stella and her friends decide to sneak into a supposedly haunted house that once belonged to the powerful Bellows family, unleashing dark forces that they will be unable to control.','https://image.tmdb.org/t/p/w500/kNjEmQGBm9cYqTB03r6yECozQyW.jpg','2019-08-08',6.5,0),(19451,'Conundrum: Secrets Among Friends','en','A story about longtime friends whom have known one another since college. All of whom have been doing well since, with careers in the entertainment industry, on wall street, legal and even in the NFL. When the group decides to take a weekend getaway, to a rented beach house in the Hamptons, all hell breaks loose when secrets among them, come to light.','https://image.tmdb.org/t/p/w500/5mKDif1K6b5ZHp7y3QKDjQSjgPL.jpg','2023-02-11',0,0),(19452,'Leatherface','en','A young nurse is kidnapped by a group of violent teens who escape from a mental hospital and take her on the road trip from hell. Pursued by an equally deranged lawman out for revenge, one of the teens is destined for tragedy and horrors that will destroy his mind, moulding him into a monster named Leatherface.','https://image.tmdb.org/t/p/w500/nV7LPlyhUxKn5y0nuItCr8D1OSu.jpg','2017-09-14',5.5,0),(19453,'Beethoven','en','The Newton family live in their comfortable home, but there seems to something missing. This \"hole\" is filled by a small puppy, who walks into their home and their lives. Beethoven, as he is named, grows into a giant of a dog... a St Bernard. Doctor Varnick, the local vet has a secret and horrible sideline, which requires lots of dogs for experiments. Beethoven is on the bad doctor\'s list.','https://image.tmdb.org/t/p/w500/mVb3r5ZOeopEbCbx6kuIAjUz20F.jpg','1992-04-03',5.8,0),(19454,'Alien Resurrection','en','Two hundred years after Lt. Ripley died, a group of scientists clone her, hoping to breed the ultimate weapon. But the new Ripley is full of surprises … as are the new aliens. Ripley must team with a band of smugglers to keep the creatures from reaching Earth.','https://image.tmdb.org/t/p/w500/bo6TCzRoyIuiedMhVX8nYoeQcky.jpg','1997-11-12',6.1,0),(19455,'Rosaline','en','Left heartbroken after Romeo begins to pursue her cousin Juliet, Rosaline schemes to foil the famous romance and win back her guy in this comedic twist of Shakespeare\'s Romeo and Juliet.','https://image.tmdb.org/t/p/w500/jQHrbzVy6ptopxqUohV6PcmmVcY.jpg','2022-10-11',7.3,0),(19456,'The Bourne Ultimatum','en','Bourne is brought out of hiding once again by reporter Simon Ross who is trying to unveil Operation Blackbriar, an upgrade to Project Treadstone, in a series of newspaper columns. Information from the reporter stirs a new set of memories, and Bourne must finally uncover his dark past while dodging The Company\'s best efforts to eradicate him.','https://image.tmdb.org/t/p/w500/15rMz5MRXFp7CP4VxhjYw4y0FUn.jpg','2007-08-03',7.4,0),(19457,'There\'s Someone Inside Your House','en','As the countdown to graduation begins, students at Osborne High are being stalked by a maniac intent on exposing their darkest secrets to the entire town, terrorizing victims while wearing a life-like mask of their own face. With a mysterious past of her own, Makani and her friends must discover the killer\'s identity before they become victims themselves.','https://image.tmdb.org/t/p/w500/GaPJQscaH4MtYQTbJyWjCUIho8.jpg','2021-09-24',5.5,0),(19458,'Fire Island','en','A pair of best friends set out to have a legendary week-long summer vacation with the help of cheap rosé and a group of eclectic friends.','https://image.tmdb.org/t/p/w500/2vVUdYoqUX5rK8plxPGERGGjQLI.jpg','2022-06-09',7.3,0),(19459,'Jan Dara: The Beginning','th','Set in the 1930s, the story recounts the growing pains of Jan, whose mother dies while giving birth to him and who’s intensely hated by his sadistic and debauched father. Jan grows up with his stepmother, and he struggles to reconcile his guilt and longing with different women in his life.','https://image.tmdb.org/t/p/w500/ykvGzFSR7mbG4xWVSI2D4vG5HZh.jpg','2012-09-06',5.5,0),(19460,'The Darkest Minds','en','After a disease kills 98% of America\'s children, the surviving 2% develop superpowers and are placed in internment camps. A 16-year-old girl escapes her camp and joins a group of other teens on the run from the government.','https://image.tmdb.org/t/p/w500/94RaS52zmsqaiAe1TG20pdbJCZr.jpg','2018-07-25',7,0),(19461,'The Farm','en','A young couple gets kidnapped and treated like farm animals after stopping at a roadside diner to eat meat.','https://image.tmdb.org/t/p/w500/7nPMR3QU5vl7cEmB1LE6O6yliCg.jpg','2019-04-19',5.3,0),(19462,'Breach','en','A hardened mechanic must stay awake and maintain an interstellar ark fleeing the dying planet Earth with a few thousand lucky souls on board... the last of humanity. Unfortunately, humans are not the only passengers. A shapeshifting alien creature has taken residence, its only goal is to kill as many people as possible. The crew must think quickly to stop this menace before it destroys mankind.','https://image.tmdb.org/t/p/w500/13B6onhL6FzSN2KaNeQeMML05pS.jpg','2020-12-17',4.3,0),(19463,'The Thing','en','When paleontologist Kate Lloyd travels to an isolated outpost in Antarctica for the expedition of a lifetime, she joins an international team that unearths a remarkable discovery. Their elation quickly turns to fear as they realize that their experiment has freed a mysterious being from its frozen prison. Paranoia spreads like an epidemic as a creature that can mimic anything it touches will pit human against human as it tries to survive and flourish in this spine-tingling thriller.','https://image.tmdb.org/t/p/w500/dmn2nVo8h7LMnk694JxCRIwK06p.jpg','2011-10-12',6.2,0),(19464,'Night Watch','ru','Among normal humans live the \"Others\" possessing various supernatural powers. They are divided up into the forces of light and the forces of the dark, who signed a truce several centuries ago to end a devastating battle. Ever since, the forces of light govern the day while the night belongs to their dark opponents. In modern day Moscow the dark Others actually roam the night as vampires while a \"Night Watch\" of light forces, among them Anton, the movie\'s protagonist, try to control them and limit their outrage','https://image.tmdb.org/t/p/w500/inkEqKKVqJoLB3ioCnn4h0UC9GP.jpg','2004-06-27',6.3,0),(19465,'Selena','en','In this biographical drama, Selena Quintanilla is born into a musical Mexican-American family in Texas. Her father, Abraham, realizes that his young daughter is talented and begins performing with her at small venues. She finds success and falls for her guitarist, Chris Perez, who draws the ire of her father. Seeking mainstream stardom, Selena begins recording an English-language album which, tragically, she would never complete.','https://image.tmdb.org/t/p/w500/j8xX3yBAFOayfSaImgLZPnAcdWz.jpg','1997-03-21',7.7,0),(19466,'Studio 666','en','Legendary rock band Foo Fighters move into an Encino mansion steeped in grisly rock and roll history to record their much anticipated 10th album. Once in the house, Dave Grohl finds himself grappling with supernatural forces that threaten both the completion of the album and the lives of the band.','https://image.tmdb.org/t/p/w500/zD2XyaV6eGEEgEzVnjg0hQVR5yz.jpg','2022-02-24',6.2,0),(19467,'Ace Ventura: Pet Detective','en','He\'s Ace Ventura: Pet Detective. Jim Carrey is on the case to find the Miami Dolphins\' missing mascot and quarterback Dan Marino. He goes eyeball to eyeball with a man-eating shark, stakes out the Miami Dolphins and woos and wows the ladies. Whether he\'s undercover, under fire or underwater, he always gets his man… or beast!','https://image.tmdb.org/t/p/w500/pqiRuETmuSybfnVZ7qyeoXhQyN1.jpg','1994-02-04',6.5,0),(19468,'Dos más dos','es','','https://image.tmdb.org/t/p/w500/pcjTf0tBJoGwJQbdai4GmX8d1Om.jpg','2022-03-31',6.7,0),(19469,'They/Them','en','Campers at an LGBTQ+ conversion camp endure unsettling psychological techniques while the campsite is stalked by a mysterious killer.','https://image.tmdb.org/t/p/w500/85TJ4udfUOwFIlvQL6EMFvvbvN5.jpg','2022-07-24',5.1,0),(19470,'Sinister Stepsister','en','Jeff Mitchell seems to have it all. He has an interesting and lucrative job, a loving wife, and two amazing kids. Therefore, life is good. However, on one bright day, a cosmic sucker punch comes out of the blue. When Jeff was in high school, unbeknownst to him, he got his girlfriend pregnant. Next, the girl moved away, had the baby, and raised her as a single mother, never telling her daughter, Carlee, who her real father was. However, Carlee\'s mother recently died in a tragic accident, prompting Carlee to try and uncover the truth. Maybe Jeff is not so lucky after all?','https://image.tmdb.org/t/p/w500/iMOw9HjsRRHWfyPU1LP6dR7W9XB.jpg','2022-03-11',6.7,0),(19471,'Rumble in the Bronx','cn','Keong comes from Hong Kong to visit New York for his uncle\'s wedding. His uncle runs a market in the Bronx and Keong offers to help out while Uncle is on his honeymoon. During his stay in the Bronx, Keong befriends a neighbor kid and beats up some neighborhood thugs who cause problems at the market. One of those petty thugs in the local gang stumbles into a criminal situation way over his head.','https://image.tmdb.org/t/p/w500/1nAfchiXHQB3iyhK8fCJJEnNs5A.jpg','1995-01-21',6.8,0),(19472,'Gravity','en','Dr. Ryan Stone, a brilliant medical engineer on her first Shuttle mission, with veteran astronaut Matt Kowalsky in command of his last flight before retiring. But on a seemingly routine spacewalk, disaster strikes. The Shuttle is destroyed, leaving Stone and Kowalsky completely alone-tethered to nothing but each other and spiraling out into the blackness of space. The deafening silence tells them they have lost any link to Earth and any chance for rescue. As fear turns to panic, every gulp of air eats away at what little oxygen is left. But the only way home may be to go further out into the terrifying expanse of space.','https://image.tmdb.org/t/p/w500/wmUeEacsFZzDndaeOtNNmy26rYJ.jpg','2013-10-03',7.2,0),(19473,'Hellboy II: The Golden Army','en','Hellboy must stop an elven prince from locating an ancient force that can destroy humanity: the all-powerful Golden Army.','https://image.tmdb.org/t/p/w500/fGQAO4RgUzspO7L4u5KXirIn34s.jpg','2008-07-11',6.8,0),(19474,'Meet Cute','en','A wildly inventive deconstruction of the romantic comedy built around the question: What would you do if you could travel to your loved ones’ past, heal their traumas, fix their problems, and change them into the perfect partner?','https://image.tmdb.org/t/p/w500/8NBlso3DuV3frqOzLZ4UYPMTqYu.jpg','2022-09-21',5.8,0),(19475,'His House','en','After making a harrowing escape from war-torn South Sudan, a young refugee couple struggle to adjust to their new life in a small English town that has an unspeakable evil lurking beneath the surface.','https://image.tmdb.org/t/p/w500/idh2QAy5NwBRN94ScmtWrukvOgJ.jpg','2020-01-27',6.5,0),(19476,'Piranha 3DD','en','After the events at Lake Victoria, the prehistoric school of blood-thirsty piranhas make their way into swimming pools, plumbing, and a newly opened water park.','https://image.tmdb.org/t/p/w500/mv2Ej9WPVWivNvtMTTxgb07c7N9.jpg','2012-05-11',4.4,0),(19477,'Hard Target','en','When a woman\'s father goes missing, she enlists a local to aid in her search.  The pair soon discover that her father has died at the hands of a wealthy sportsman who hunts homeless men as a form of recreation.','https://image.tmdb.org/t/p/w500/kufvuQYWdl82sYzmhy2naBLyMui.jpg','1993-08-20',6.3,0),(19478,'Triangle','en','When Jess sets sail on a yacht with a group of friends, she cannot shake the feeling that there is something wrong. Her suspicions are realized when the yacht hits a storm and the group is forced to board a passing ocean liner to get to safety, a ship Jess is convinced she’s been on before.','https://image.tmdb.org/t/p/w500/qdqAewwUsKO1x2p9rAkAOBlXeiF.jpg','2009-10-16',6.9,0),(19479,'Batman: Soul of the Dragon','en','Bruce Wayne faces a deadly menace from his past, with the help of three former classmates: world-renowned martial artists Richard Dragon, Ben Turner and Lady Shiva.','https://image.tmdb.org/t/p/w500/uDhnTtSxU5a8DtZdbbin3aZmkmU.jpg','2021-01-12',6.9,0),(19480,'Escape Plan: The Extractors','en','After security expert Ray Breslin is hired to rescue the kidnapped daughter of a Hong Kong tech mogul from a formidable Latvian prison, Breslin\'s girlfriend is also captured. Now he and his team must pull off a deadly rescue mission to confront their sadistic foe and save the hostages before time runs out.','https://image.tmdb.org/t/p/w500/r15SUgzjL8bablcdEkHk9T7TSRl.jpg','2019-06-20',5.3,0),(19481,'Stuart Little 2','en','Stuart, an adorable white mouse, still lives happily with his adoptive family, the Littles, on the east side of Manhattan\'s Central Park. More crazy mouse adventures are in store as Stuart, his human brother, George, and their mischievous cat, Snowbell, set out to rescue a friend.','https://image.tmdb.org/t/p/w500/hjfeMLWqJY44mqqJKZSa6jx4Y1j.jpg','2002-07-19',5.7,0);
INSERT INTO `movies` VALUES (19482,'Horrible Bosses','en','For Nick, Kurt and Dale, the only thing that would make the daily grind more tolerable would be to grind their intolerable bosses into dust. Quitting is not an option, so, with the benefit of a few-too-many drinks and some dubious advice from a hustling ex-con, the three friends devise a convoluted and seemingly foolproof plan to rid themselves of their respective employers... permanently.','https://image.tmdb.org/t/p/w500/uQkUwgyFHAm0jGQERPG6Z9o9Zbj.jpg','2011-07-08',6.6,0),(19483,'Sorry If I Call You Love','es','A successful, attractive, intelligent and brilliant advertising executive is longing to finally find emotional stability in his life, and decides to propose to his girlfriend. After she refuses his proposal, his life takes a turn when a new young lady enters his life.','https://image.tmdb.org/t/p/w500/7RQdmFiEhb8zn5jmsLqdNnmepUE.jpg','2014-06-20',7.4,0),(19484,'Olaf\'s Frozen Adventure','en','Olaf is on a mission to harness the best holiday traditions for Anna, Elsa, and Kristoff.','https://image.tmdb.org/t/p/w500/As8WTtxXs9e3cBit3ztTf7zoRmm.jpg','2017-10-27',6.4,0),(19485,'Beauty and the Beast: The Enchanted Christmas','en','Astonished to find the Beast has a deep-seeded hatred for the Christmas season, Belle endeavors to change his mind on the matter.','https://image.tmdb.org/t/p/w500/qxtpbcbf6KEIHzLetWZOVGJT2lv.jpg','1997-11-11',6.2,0),(19486,'The Witcher: Nightmare of the Wolf','en','Escaping from poverty to become a witcher, Vesemir slays monsters for coin and glory, but when a new menace rises, he must face the demons of his past.','https://image.tmdb.org/t/p/w500/3sLz2yv6vBDWqBbd8rdnNeoJ2kJ.jpg','2021-08-23',7.6,0),(19487,'Pamasahe','tl','A penniless mother, with her infant child, takes on a journey by land and sea to find her husband in Manila. But this trip won\'t be free for she has to use her body to get to her destination.','https://image.tmdb.org/t/p/w500/6spqXV5kgNkZBIwjuZkxIx8flfQ.jpg','2022-12-09',6.5,0),(19488,'Cold Mountain','en','In this classic story of love and devotion set against the backdrop of the American Civil War, a wounded Confederate soldier named W.P. Inman deserts his unit and travels across the South, aiming to return to his young wife, Ada, who he left behind to tend their farm. As Inman makes his perilous journey home, Ada struggles to keep their home intact with the assistance of Ruby, a mysterious drifter sent to help her by a kindly neighbor.','https://image.tmdb.org/t/p/w500/32MsALfK6shuSopCrFjSNoxDc5p.jpg','2003-12-24',6.9,0),(19489,'Sakra','cn','New adaptation of Louis Cha\'s wuxia novel Demi-Gods and Semi-Devils.','https://image.tmdb.org/t/p/w500/vksLBSmHahKD9F30vIrm0S7JsSO.jpg','2023-01-16',5.2,0),(19490,'The Figo Affair: The Transfer That Changed Football','en','This documentary spotlights one of the most contentious deals in football history and the extraordinary player at the center of the storm: Luís Figo.','https://image.tmdb.org/t/p/w500/cmUmwFRrgQguSPPut2SYzwNEQEY.jpg','2022-08-25',7.1,0),(19491,'The Virtuoso','en','A lonesome stranger with nerves of steel must track down and kill a rogue hitman to satisfy an outstanding debt. But the only information he\'s been given is a time and location where to find his quarry. No name. No description. Nothing.','https://image.tmdb.org/t/p/w500/vXHzO26mJaOt4VO7ZFiM6No5ScT.jpg','2021-04-30',6.1,0),(19492,'Dragonball Evolution','en','On his 18th birthday, Goku receives a mystical Dragonball as a gift from his grandfather. There are only six others like it in the whole world, and legend has it that whoever possesses all seven will be granted one perfect wish. When the arrival of a dark force triggers a tragedy, Goku and his companions are propelled into an epic quest to collect the seven Dragonballs and save the Earth from destruction.','https://image.tmdb.org/t/p/w500/23PcKOqNdhKeMFzORzQGn5eC44N.jpg','2009-03-12',2.8,0),(19493,'Turbo: A Power Rangers Movie','en','The legendary Power Rangers must stop the evil space pirate Divatox from releasing the powerful Maligore from his volcanic imprisonment on the island of Muranthias, where only the kindly wizard Lerigot has the key to release him. The hope of victory lies in the Ranger\'s incredible new Turbo powers and powerful Turbo Zords.','https://image.tmdb.org/t/p/w500/sHgjdRPYduUCaw3Te2CXaWLpBkm.jpg','1997-03-27',5.8,0),(19494,'The Invisible Man','en','When Cecilia\'s abusive ex takes his own life and leaves her his fortune, she suspects his death was a hoax. As a series of coincidences turn lethal, Cecilia works to prove that she is being hunted by someone nobody can see.','https://image.tmdb.org/t/p/w500/5EufsDwXdY2CVttYOk2WtYhgKpa.jpg','2020-02-26',7.1,0),(19495,'Tenor','fr','While working part-time as a food deliveryman, Antoine, an aspiring young rapper from the suburbs of Paris, meets Mrs. Loiseau, an eminent teacher at the Paris Opéra. Stunned by the young man\'s raw talent, she introduces him to the world of opera. As Antoine becomes one of Mrs. Loiseau\'s students, he hides his new dream from his friends and family, fearing that they won’t understand – this double life burdens him... Somewhere in between the gilded and uptight Parisian upper-class, and the harsh yet free-spirited and familiar suburbs he grew up in, Antoine will have to find his own voice.','https://image.tmdb.org/t/p/w500/14195Sv9rUHXJAuWbjFDtRQMUCf.jpg','2022-05-04',7.2,0),(19496,'Frequency','en','When a rare phenomenon gives police officer John Sullivan the chance to speak to his father, 30 years in the past, he takes the opportunity to prevent his dad\'s tragic death.  After his actions inadvertently give rise to a series of brutal murders he and his father must find a way to fix the consequences of altering time.','https://image.tmdb.org/t/p/w500/aFuw2yow5Og0e2M7uEHQtpS5GPz.jpg','2000-04-28',7.2,0),(19497,'Cruel Intentions','en','Slaking a thirst for dangerous games, Kathryn challenges her stepbrother, Sebastian, to deflower their headmaster\'s daughter before the summer ends. If he succeeds, the prize is the chance to bed Kathryn. But if he loses, Kathryn will claim his most prized possession.','https://image.tmdb.org/t/p/w500/76cCsRtQ5MJBAqoigojXsLXLJwh.jpg','1999-03-05',6.8,0),(19498,'High School Musical','en','Troy, the popular captain of the basketball team, and Gabriella, the brainy and beautiful member of the academic club, break all the rules of East High society when they secretly audition for the leads in the school\'s musical. As they reach for the stars and follow their dreams, everyone learns about acceptance, teamwork, and being yourself.','https://image.tmdb.org/t/p/w500/1DGmWZjUJPeKGFRHGCA6VPFUBML.jpg','2006-01-20',6.6,0),(19499,'The League of Extraordinary Gentlemen','en','To prevent a world war from breaking out, famous characters from Victorian literature band together to do battle against a cunning villain.','https://image.tmdb.org/t/p/w500/rlOyMxW5Ed10wRvZbhlwRYInyBf.jpg','2003-07-11',6,0),(19500,'Leroy & Stitch','en','Lilo, Stitch, Jumba, and Pleakley have finally caught all of Jumba\'s genetic experiments and found the one true place where each of them belongs. Stitch, Jumba and Pleakley are offered positions in the Galactic Alliance, turning them down so they can stay on Earth with Lilo, but Lilo realizes her alien friends have places where they belong – and it\'s finally time to say \"aloha\".','https://image.tmdb.org/t/p/w500/1LCfRArffse3PnqkACooOHkWcry.jpg','2006-06-23',6.6,0),(19501,'The Blue Lagoon','en','Two small children and a ship\'s cook survive a shipwreck and find safety on an idyllic tropical island. Soon, however, the cook dies and the young boy and girl are left on their own. Days become years and Emmeline and Richard make a home for themselves surrounded by exotic creatures and nature\'s beauty. But will they ever see civilization again?','https://image.tmdb.org/t/p/w500/k6KsThCeoxxHDbVnlHLdTlf5wsy.jpg','1980-07-05',6.2,0),(19502,'How to Be Single','en','New York City is full of lonely hearts seeking the right match, and what Alice, Robin, Lucy, Meg, Tom and David all have in common is the need to learn how to be single in a world filled with ever-evolving definitions of love.','https://image.tmdb.org/t/p/w500/a4Ce3qHqIyHM3QfGsiVTAu3YADJ.jpg','2016-01-21',6.2,0),(19503,'Ice Age: The Great Egg-Scapade','en','A harried prehistoric bird mother entrusts her precious, soon-to-hatch egg to Sid. When she recommends him to her neighbours, business booms at his new egg-sitting service. However, dastardly pirate bunny, Squint, who is seeking revenge on the herd, steals, camouflages and hides all the eggs. Once again, with Squint’s twin brother assisting, Manny, Diego and the rest of the gang come to the rescue and take off on a daring mission that turns into the world’s first Easter egg hunt.','https://image.tmdb.org/t/p/w500/ysQqYp9G37Q114Nc6uvCHbDmaj6.jpg','2016-03-19',6.4,0),(19504,'A Knight\'s Tale','en','William Thatcher, a knight\'s peasant apprentice, gets a chance at glory when the knight dies suddenly mid-tournament. Posing as a knight himself, William won\'t stop until he\'s crowned tournament champion—assuming matters of the heart don\'t get in the way.','https://image.tmdb.org/t/p/w500/srb1XnrlDZHcdpjBKqUu4qAzxKU.jpg','2001-05-11',6.9,0),(19505,'Peppermint','en','A grieving mother transforms herself into a vigilante following the murders of her husband and daughter, eluding the authorities to deliver her own personal brand of justice.','https://image.tmdb.org/t/p/w500/jrzxS0vcbzIIay1sdYm0rgI2QfJ.jpg','2018-09-06',6.7,0),(19506,'Diary of a Wimpy Kid: Rodrick Rules','en','Wimpy Greg Heffley, now in seventh grade, thinks he has it all together. He has mastered middle school and gotten rid of the Cheese Touch. However, Greg\'s older brother, Rodrick, is itching to cut him down to size. He gets the perfect opportunity when their mother tries to force the boys to bond. Rodrick may be Greg\'s chief tormentor, but he feels his constant pranks are just what his little brother needs to prepare him for life\'s hard knocks.','https://image.tmdb.org/t/p/w500/vTf3MJOGUDpm5VEIkpy82aDKdZW.jpg','2011-03-25',6.6,0),(19507,'Hook','en','The boy who wasn\'t supposed grow up—Peter Pan—does just that, becoming a soulless corporate lawyer whose workaholism could cost him his wife and kids. During his trip to see Granny Wendy in London, the vengeful Capt. Hook kidnaps Peter\'s kids and forces Peter to return to Neverland.','https://image.tmdb.org/t/p/w500/a6rB1lGXoGms7gWxRfJneQmAjNV.jpg','1991-04-10',6.8,0),(19508,'Leprechaun','en','A demonic leprechaun terrorizes a group of young people whom he believes stole his gold.','https://image.tmdb.org/t/p/w500/fFSiXLJTqWU0Eh2DMvwi4sBmdAP.jpg','1993-01-08',5.6,0),(19509,'13 Going on 30','en','After total humiliation at her thirteenth birthday party, Jenna Rink wants to just hide until she\'s thirty. With a little magic, her wish is granted, but it turns out that being thirty isn\'t as always as awesome as she thought it would be!','https://image.tmdb.org/t/p/w500/iNZdSIfhSCMtRILDNyhLn8UKeSG.jpg','2004-04-13',6.7,0),(19510,'It Boy','fr','38-year-old Alice has everything to become the next editor-in-chief of Rebelle magazine except for her uptight image. But when the young and charming Balthazar, barely 20, crosses Alice\'s path, she realizes that he holds the key to her promotion.','https://image.tmdb.org/t/p/w500/33q9xUJhpi5JUWr1uSUyUvctR7p.jpg','2013-03-06',6.3,0),(19511,'Storks','en','Storks deliver babies…or at least they used to. Now they deliver packages for a global internet retail giant. Junior, the company’s top delivery stork, is about to be promoted when he accidentally activates the Baby Making Machine, producing an adorable and wholly unauthorized baby girl...','https://image.tmdb.org/t/p/w500/uxjgGjX4lxfGcxUeB15nm7itrwM.jpg','2016-09-22',6.6,0),(19512,'42','en','The powerful story of Jackie Robinson, the legendary baseball player who broke Major League Baseball’s color barrier when he joined the roster of the Brooklyn Dodgers. The film follows the innovative Dodgers’ general manager Branch Rickey, the MLB executive who first signed Robinson to the minors and then helped to bring him up to the show.','https://image.tmdb.org/t/p/w500/npWmmadYcEWKmCHS3prucSVJHjH.jpg','2013-04-12',7.1,0),(19513,'Mulholland Drive','en','Blonde Betty Elms has only just arrived in Hollywood to become a movie star when she meets an enigmatic brunette with amnesia. Meanwhile, as the two set off to solve the second woman\'s identity, filmmaker Adam Kesher runs into ominous trouble while casting his latest project.','https://image.tmdb.org/t/p/w500/tVxGt7uffLVhIIcwuldXOMpFBPX.jpg','2001-06-06',7.8,0),(19514,'Beauty and the Beast','fr','Forced to face the cruel side of life, a devastated, bankrupt merchant chances upon the enchanted castle of a hideous creature, the mere sight of it chills the bone to the marrow. There, a fate worse than death awaits the poor father-of-six, who, after plucking a sweet-scented rose from the repulsive master\'s verdant garden, must do the impossible: permit his compassionate daughter, Belle, to take his place and pay for the sins of her parent. Now, an impenetrable mystery shrouds the haunted mansion, and, as repugnance gradually turns into affection, only true love could break the spell.','https://image.tmdb.org/t/p/w500/8bErT2koHXAUSW5PdLQqgL5gEEe.jpg','2014-02-12',6.1,0),(19515,'Goodnight Mommy','en','When twin brothers arrive home to find their mother’s demeanor altered and face covered in surgical bandages, they begin to suspect the woman beneath the gauze might not be their mother.','https://image.tmdb.org/t/p/w500/oHhD5jD4S5ElPNNFCDKXJAzMZ5h.jpg','2022-09-16',6.3,0),(19516,'Transformers: Revenge of the Fallen','en','Sam Witwicky leaves the Autobots behind for a normal life. But when his mind is filled with cryptic symbols, the Decepticons target him and he is dragged back into the Transformers\' war.','https://image.tmdb.org/t/p/w500/pLBb0whOzVDtJvyD4DPeQyQNOqp.jpg','2009-06-19',6.1,0),(19517,'Bad Trip','en','Two pals embark on a road trip full of funny pranks that pull real people into mayhem.','https://image.tmdb.org/t/p/w500/A1Gy5HX3DKGaNW1Ay30NTIVJqJ6.jpg','2021-03-26',6,0),(19518,'Stan Helsing','en','It\'s Halloween night and video store clerk Stan Helsing just got stuck with a last minute request to deliver some videos. With his best friend, his best friend\'s date, and a smoking hot ex-girlfriend waiting to go to a party, Stan convinces them to take a side trip to Stormy Night Estates for the drop. But the group gets locked inside and Stan discovers he\'s actually Stan Van Helsing, descendan','https://image.tmdb.org/t/p/w500/qDlmKahejt0NoQzw65tnLayEhHZ.jpg','2009-10-27',4.2,0),(19519,'RoboCop','en','In RoboCop, the year is 2028 and multinational conglomerate OmniCorp is at the center of robot technology.  Overseas, their drones have been used by the military for years, but have been forbidden for law enforcement in America.  Now OmniCorp wants to bring their controversial technology to the home front, and they see a golden opportunity to do it.  When Alex Murphy – a loving husband, father and good cop doing his best to stem the tide of crime and corruption in Detroit – is critically injured, OmniCorp sees their chance to build a part-man, part-robot police officer.  OmniCorp envisions a RoboCop in every city and even more billions for their shareholders, but they never counted on one thing: there is still a man inside the machine.','https://image.tmdb.org/t/p/w500/gM5ql3BKYmHG3WtZ0buKXN7xY8O.jpg','2014-01-30',5.8,0),(19520,'Barbie as the Island Princess','en','Barbie plays Rosella in this new musical film. Shipwrecked as a child, Rosella grows up on the island under the watchful eyes of her loving animal friends. The arrival of Prince Antonio leads Rosella and her furry pals to explore civilization and ultimately save the 