.org/t/p/w500/l7iJoJBoP046hWyeeC2CQ6knOeK.jpg','2017-12-22',5.3,0),(19579,'Queen of Hearts','da','Anne, a brilliant and dedicated advocacy lawyer specialising in society’s most vulnerable, children and young adults, lives what appears to be the picture-perfect life with her doctor-husband, Peter, and their twin daughters. When her estranged teenage stepson, Gustav, moves in with them, Anne’s escalating desire leads her down a dangerous rabbit hole which, once exposed, unleashes a sequence of events destined to destroy her world.','https://image.tmdb.org/t/p/w500/dfFVDIgovEfQZn53VRKLV2JQnRJ.jpg','2019-03-27',6.9,0),(19580,'Mad Max 2','en','Max Rockatansky returns as the heroic loner who drives the dusty roads of a postapocalyptic Australian Outback in an unending search for gasoline. Arrayed against him and the other scraggly defendants of a fuel-depot encampment are the bizarre warriors commanded by the charismatic Lord Humungus, a violent leader whose scruples are as barren as the surrounding landscape.','https://image.tmdb.org/t/p/w500/lyFPvG4VJGlBKQtjyQnnpLEMog1.jpg','1981-12-24',7.4,0),(19581,'A Prince in Paradise','en','Olivia, struggling with writer\'s block after a break up, takes a tropical holiday in hope of some inspiration and meets Prince Alexander, who needs some distance from his duty to marry royalty.','https://image.tmdb.org/t/p/w500/1TvadZkkskuOZHHoInE9wMXheh1.jpg','2023-01-07',7,0),(19582,'Murder on the Orient Express','en','Genius Belgian detective Hercule Poirot investigates the murder of an American tycoon aboard the Orient Express train.','https://image.tmdb.org/t/p/w500/kc2gJjebceoFgOQbukzPzP8SXVZ.jpg','2017-11-03',6.7,0),(19583,'Mannequin','en','Jonathan Switcher, an unemployed artist, finds a job as an assistant window dresser for a department store. When Jonathan happens upon a beautiful mannequin he previously designed, she springs to life and introduces herself as Emmy, an Egyptian under an ancient spell. Despite interference from the sto