rlie how to defuse her power, which is triggered by anger or pain. But as Charlie turns 11, the fire becomes harder and harder to control. After an incident reveals the family\'s location, a mysterious operative is deployed to hunt down the family and seize Charlie once and for all. Charlie has other plans.','https://image.tmdb.org/t/p/w500/2MTGip0nfahQ1jPQCZSfCsPBZes.jpg','2022-05-12',5.8,0),(19588,'Don Jon','en','A New Jersey guy dedicated to his family, friends, and church, develops unrealistic expectations from watching porn and works to find happiness and intimacy with his potential true love.','https://image.tmdb.org/t/p/w500/uh8bwvgGXeUKzdL4oSul9zxyTcd.jpg','2013-09-12',6,0),(19589,'Come Play With Me','es','Sofia, an insecure young woman, begins babysitting two troublesome siblings that turn her job into a complete living hell. That is until a devilish presence starts messing with the trio and they must band together to fight the demon away.','https://image.tmdb.org/t/p/w500/iM5kNvZzcMSmWv7CFTxnTu5zfoa.jpg','2021-02-25',6.9,0),(19590,'Batman: Under the Red Hood','en','One part vigilante, one part criminal kingpin, Red Hood begins cleaning up Gotham with the efficiency of Batman, but without following the same ethical code.','https://image.tmdb.org/t/p/w500/7lmHqHg1rG9b4U8MjuyQjmJ7Qm0.jpg','2010-07-27',7.8,0),(19591,'Demolition Man','en','Simon Phoenix, a violent criminal cryogenically frozen in 1996, escapes during a parole hearing in 2032 in the utopia of San Angeles. Police are incapable of dealing with his violent ways and turn to his captor, who had also been cryogenically frozen after being wrongfully accused of killing 30 innocent people while apprehending Phoenix.','https://image.tmdb.org/t/p/w500/pxWuGsyzVQSqHWxVQLy4XUcopIL.jpg','1993-10-08',6.7,0),(19592,'Lights Out','en','Rebecca must unlock the terror behind her little brother\'s experiences that once tested her sanity, bringing her face to face with a supernatural spirit attached to their mother.'