rpose in life and become a chicken instead of dying in a frying pan; so he starts a quest to return to the farms along with his new friend, the noisy egg Willy and a crazy bacon stripe. The three friends will face lot of obstacles in their quest.','https://image.tmdb.org/t/p/w500/sWl9Qhv8PZyq6gviDeT88kBU3tI.jpg','2006-04-21',7.7,0),(19604,'Antichrist','en','A grieving couple retreats to their cabin \'Eden\' in the woods, hoping to repair their broken hearts and troubled marriage. But nature takes its course and things go from bad to worse.','https://image.tmdb.org/t/p/w500/7dZolgPm00vOd7RxWOMf94pA67J.jpg','2009-05-20',6.7,0),(19605,'More the Merrier','es','Multiple stories about the oscillating world of couple relationships and how difficult it can be to separate sex from love.','https://image.tmdb.org/t/p/w500/uShw8wJ7K4ySrPtUWjGe8wwJ5fj.jpg','2021-07-30',6.7,0),(19606,'Lake Placid vs. Anaconda','en','A giant alligator goes head to head with a giant Anaconda. The town sheriff must find a way to destroy the two monsters before they kill the whole town.','https://image.tmdb.org/t/p/w500/vWTTolhnR1yW7z1YAIC5vrTn4s8.jpg','2015-04-25',5.3,0),(19607,'Cell 211','es','The story of two men on different sides of a prison riot -- the inmate leading the rebellion and the young guard trapped in the revolt, who poses as a prisoner in a desperate attempt to survive the ordeal.','https://image.tmdb.org/t/p/w500/koap5B3bQHQi3yaZ39vpWR66TGP.jpg','2009-11-06',7.5,0),(19608,'Amélie','fr','At a tiny Parisian café, the adorable yet painfully shy Amélie accidentally discovers a gift for helping others. Soon Amelie is spending her days as a matchmaker, guardian angel, and all-around do-gooder. But when she bumps into a handsome stranger, will she find the courage to become the star of her very own love story?','https://image.tmdb.org/t/p/w500/oTKduWL2tpIKEmkAqF4mFEAWAsv.jpg','2001-04-25',7.9,0),(19609,'Europa Report','en','A crew of international astronauts are sent on a private mission t