h his daughter\'s young rich boyfriend.','https://image.tmdb.org/t/p/w500/eezFoKz7bXgdbjeieeCYJFXPKSu.jpg','2016-12-22',6.4,0),(19927,'Red Dawn','en','It is the dawn of World War III. In mid-western America, a group of teenagers band together to defend their town—and their country—from invading Soviet forces.','https://image.tmdb.org/t/p/w500/a2GkHcioc2QEFJbQk1NTB85u3vD.jpg','1984-08-10',6.3,0),(19928,'Idiocracy','en','To test its top-secret Human Hibernation Project, the Pentagon picks the most average Americans it can find - an Army private and a prostitute - and sends them to the year 2505 after a series of freak events. But when they arrive, they find a civilization so dumbed-down that they\'re the smartest people around.','https://image.tmdb.org/t/p/w500/k75tEyoPbPlfHSKakJBOR5dx1Dp.jpg','2006-09-01',6.3,0),(19929,'The Last Boy Scout','en','When the girl that detective Joe Hallenback is protecting gets murdered, the boyfriend of the murdered girl attempts to investigate and solve the case. What they discover is that there is deep seated corruption going on between a crooked politician and the owner of a pro football team.','https://image.tmdb.org/t/p/w500/k6IhU7Vuy9kvK3xrJRZnDd7Zh7H.jpg','1991-03-19',6.8,0),(19930,'War','en','FBI agent Jack Crawford is out for revenge when his partner is killed and all clues point to the mysterious assassin Rogue. But when Rogue turns up years later to take care of some unfinished business, he triggers a violent clash of rival gangs. Will the truth come out before it\'s too late? And when the dust settles, who will remain standing?','https://image.tmdb.org/t/p/w500/scFc8RD4sFxB2x0eIOaymphMnYh.jpg','2007-08-24',6.3,0),(19931,'Freaky','en','A mystical, ancient dagger causes a notorious serial killer to magically switch bodies with a 17-year-old girl.','https://image.tmdb.org/t/p/w500/8xC6QSyxrpm0D5A6iyHNemEWBVe.jpg','2020-11-12',6.6,0),(19932,'Benedetta','fr','A 17th-century nun becomes entangled in a forbidden lesbian affair with