op who is just out of rehab takes the graveyard shift in a city hospital morgue, she faces a series of bizarre, violent events caused by an evil entity in one of the corpses.','https://image.tmdb.org/t/p/w500/hDDb0H0uJp2wjoJBbBHbKlYRbug.jpg','2018-11-29',5.5,0),(20040,'Accident Man','en','Mike Fallon, the Accident Man, is a stone cold killer.  When a loved one is murdered by his own crew, Fallon is forced to avenge the one person who actually meant something to him.','https://image.tmdb.org/t/p/w500/bHFKej3Dbr8kGRSRHpkoFHq9TJQ.jpg','2018-02-06',6.1,0),(20041,'Girl Friday','tl','A wife resorts to sexual explorations in order to save their marriage but when her plan backfires she devises an evil scheme.','https://image.tmdb.org/t/p/w500/7isaQ0kCpOPevBBpagahMNYU8oI.jpg','2022-09-30',4.7,0),(20042,'Let There Be Light','en','An atheist goes through a near-death experience in an auto accident before converting to Christianity.','https://image.tmdb.org/t/p/w500/a1lCoSdAEYEs4ezvm5PcufEUVti.jpg','2017-10-27',6.2,0),(20043,'Taxi','en','A mouthy and feisty taxicab driver has hot tips for a green and inept cop set on solving a string of New York City bank robberies committed by a quartet of female Brazilian bank robbers.','https://image.tmdb.org/t/p/w500/5EJ3XEuiXCoqqYF7RIhWV0tByrB.jpg','2004-10-06',5.6,0),(20044,'The Peanuts Movie','en','Snoopy embarks upon his greatest mission as he and his team take to the skies to pursue their arch-nemesis, while his best pal Charlie Brown begins his own epic quest.','https://image.tmdb.org/t/p/w500/odpugRSNd7QCCxZqZZwv3vNEIph.jpg','2015-11-01',6.9,0),(20045,'South Park the Streaming Wars','en','Cartman locks horns with his mom in a battle of wills while an epic conflict unfolds that threatens South Park’s very existence.','https://image.tmdb.org/t/p/w500/dfgZJlKYg5xm6dBl05bOKhfunXb.jpg','2022-06-01',7.4,0),(20046,'Revenge','fr','Jen\'s romantic getaway with her wealthy married boyfriend is disrupted when his friends arrive for an impromptu