ica, they find that they are still having problems with the threat of cats. That makes them eager to try another home out in the west, where they are promised that mice and cats live in peace. Unfortunately, the one making this claim is an oily con artist named Cat R. Waul who is intent on his own sinister plan.','https://image.tmdb.org/t/p/w500/cImuS7FE9MHT5vnwIHGx1Ryh0K1.jpg','1991-11-21',6.4,0),(20053,'Legend of the Guardians: The Owls of Ga\'Hoole','en','Soren, a young barn owl, is kidnapped by owls of St. Aggie\'s, ostensibly an orphanage, where owlets are brainwashed into becoming soldiers. He and his new friends escape to the island of Ga\'Hoole, to assist its noble, wise owls who fight the army being created by the wicked rulers of St. Aggie\'s. The film is based on the first three books in the series.','https://image.tmdb.org/t/p/w500/zKY2nJPozrItOsSCkjgY7QPkLrE.jpg','2010-07-10',6.8,0),(20054,'6 Bullets','en','An ex-mercenary known for finding missing children is hired by a mixed martial arts fighter whose daughter has been kidnapped.','https://image.tmdb.org/t/p/w500/tniFHeiQU55feNik7X0mHlEe9DE.jpg','2012-09-11',6.1,0),(20055,'Robbing Mussolini','it','At the end of WWII, an ambitious bootlegger and his nightclub-singing girlfriend assemble a ragtag bunch of misfits for an impossible heist: to steal Mussolini\'s treasure right from his headquarters.','https://image.tmdb.org/t/p/w500/cbdHqb0kZTgF7jQbUw41KEYVInb.jpg','2022-10-26',5.6,0),(20056,'Some Like It Rare','fr','Sophie and Vincent’s small butcher shop is on the brink of bankruptcy and their marriage is falling apart. Their lives are turned upside down when Vincent accidentally kills a vegan activist who vandalized their shop. Overwhelmed and terrified of being accused of murder, their only solution is to get rid of the body by turning it into ham. To their surprise the ham is so popular that it may save their business… that is if they’re ready to keep “hunting\"!','https://image.tmdb.org/t/p/w500/p8ph