compassion to fight for her life, and those of her fellow classmates, against a group of live-streaming school shooters.','https://image.tmdb.org/t/p/w500/wlP25H14OvKoFORIwuKomZzioA5.jpg','2021-06-17',6.8,0),(20063,'Look Both Ways','en','On the eve of her college graduation, Natalie\'s life diverges into two parallel realities: one in which she becomes pregnant and must navigate motherhood as a young adult in her Texas hometown, the other in which she moves to LA to pursue her career. In both journeys throughout her twenties, Natalie experiences life-changing love, devastating heartbreak and rediscovers herself.','https://image.tmdb.org/t/p/w500/jq8IGJgg16mJ95a5OPyS7eGJaam.jpg','2022-08-17',7,0),(20064,'Darkest Hour','en','A thrilling and inspiring true story begins on the eve of World War II as, within days of becoming Prime Minister of Great Britain, Winston Churchill must face one of his most turbulent and defining trials: exploring a negotiated peace treaty with Nazi Germany, or standing firm to fight for the ideals, liberty and freedom of a nation. As the unstoppable Nazi forces roll across Western Europe and the threat of invasion is imminent, and with an unprepared public, a skeptical King, and his own party plotting against him, Churchill must withstand his darkest hour, rally a nation, and attempt to change the course of world history.','https://image.tmdb.org/t/p/w500/z0K8uoNbrYKkbaP7wIeadJ4BmSL.jpg','2017-11-22',7.4,0),(20065,'Ghostland','en','A mother of two inherits a home from her aunt. On the first night in the new home she is confronted with murderous intruders and fights for her daughters’ lives. Sixteen years later the daughters reunite at the house, and that is when things get strange . . .','https://image.tmdb.org/t/p/w500/tt9YSQlArAj6849SQQJ5ryNgcJs.jpg','2018-03-14',7.3,0),(20066,'All That Breathes','hi','Against the darkening backdrop of New Delhi\'s apocalyptic air and escalating violence, two brothers devote their lives to protecting one casualty of the turbulent times: the bird known as the black kite.','https://image.tmdb.org/t/p/w500/4X01J7lpVdWWPTKvJKc2Zbqf9V.jpg','2022-10-21',6.6,0),(20067,'Stutz','en','In candid conversations with actor Jonah Hill, leading psychiatrist Phil Stutz explores his early life experiences and unique, visual model of therapy.','https://image.tmdb.org/t/p/w500/uOiJmotRM12wsgfwiEXsp3AErdU.jpg','2022-11-14',7.6,0),(20068,'Tangled: Before Ever After','en','Rapunzel grapples with the responsibilities of being a princess and the overprotective ways of her father. While she wholeheartedly loves Eugene, Rapunzel does not share his immediate desire to get married and settle down within the castle walls. Determined to live life on her own terms, she and her tough-as-nails Lady-in-Waiting Cassandra embark on a secret adventure where they encounter mystical rocks that magically cause Rapunzel\'s long blonde hair to grow back. Impossible to break and difficult to hide, Rapunzel must learn to embrace her hair and all that it represents.','https://image.tmdb.org/t/p/w500/8BiZ8KXS0itmOx4uQw3E8UnmqEQ.jpg','2017-03-10',6.8,0),(20069,'Ride Along 2','en','As his wedding day approaches, Ben heads to Miami with his soon-to-be brother-in-law James to bring down a drug dealer who\'s supplying the dealers of Atlanta with product.','https://image.tmdb.org/t/p/w500/2433Vt8xuDnAIDAJTNx6DEtf9Qb.jpg','2016-01-14',6.2,0),(20070,'The Commuter','en','A businessman, on his daily commute home, gets unwittingly caught up in a criminal conspiracy that threatens not only his life but the lives of those around him.','https://image.tmdb.org/t/p/w500/rDeGK6FIUfVcXmuBdEORPAGPMNg.jpg','2018-01-11',6.3,0),(20071,'Deadpool: No Good Deed','en','Deadpool sees an opportunity to save the day, but it doesn\'t go entirely as planned.','https://image.tmdb.org/t/p/w500/4ZROj6yVhHCsEhszTvGzal4woMs.jpg','2017-03-03',7.2,0),(20072,'¿Y cómo es él?','es','Thomas is a meek man on the verge of a nervous breakdown. Despite his situation he decides to fake a work trip to go to Vallarta to confront Jero, a taxi driver who is sleeping with his wife.','https://image.tmdb.org/t/p/w500/561TUe0s63tKVMMj9IZznGNoWLH.jpg','2022-04-07',7.5,0),(20073,'Mirage','es','During a mysterious thunderstorm, Vera, a young mother, manages to save a life in danger, but her good deed causes a disturbing chain of unexpected consequences.','https://image.tmdb.org/t/p/w500/oLO9y7GoyAVUVoAWD6jCgY7GQfs.jpg','2018-11-30',7.5,0),(20074,'Primal Fear','en','An arrogant, high-powered attorney takes on the case of a poor altar boy found running away from the scene of the grisly murder of the bishop who has taken him in. The case gets a lot more complex when the accused reveals that there may or may not have been a third person in the room.','https://image.tmdb.org/t/p/w500/qJf2TzE8nRTFbFMPJNW6c8mI0KU.jpg','1996-03-06',7.6,0),(20075,'August Rush','en','Lyla and Louis, a singer and a musician, fall in love, but are soon compelled to separate. Lyla is forced to give up her newborn but unknown to her, he grows up to become a musical genius.','https://image.tmdb.org/t/p/w500/oA6ZeICPINiS6YtD5WZeBaGVmuT.jpg','2007-11-21',7.4,0),(20076,'The Land Before Time: The Great Valley Adventure','en','After his tribe of herbivorous dinosaurs moves to the carnivore-free Peaceful Valley, young Littlefoot and his friends chase after a pair of dangerous dinosaurs stealing an egg from the village. While running, they accidentally cause a landslide that opens up their home to outsiders. When the egg they bring back and hatch reveals not one of their own, but a carnivorous tyrannosaurus, the youngsters decide to secretly raise it.','https://image.tmdb.org/t/p/w500/1lIkU6gbqMx4oRDGegawLdQdLJD.jpg','1994-12-12',6.3,0),(20077,'Anaconda 3: Offspring','en','Cancer-terminal tycoon Peter Murdoch\'s secret Wexel Hall Pharmaceuticals lab has developed a blood orchid extract cure. To examine why it works optimally in snakes, they also bread a super-anaconda strain. But the original pair escapes, leaving a bloody trail of corpses. Murdoch runs, instructing his staff to clean up. They keep failing and being eaten like unsuspecting locals, some alive, even after enlisting ruthless big game hunter Hammett. The fast-growing pregnant monster sheds its skin, thus disabling the only tracking device.','https://image.tmdb.org/t/p/w500/ce2z5H6gS6mc54kpnFj9G0xjH4G.jpg','2008-01-01',4.8,0),(20078,'Surviving Paradise: A Family Tale','en','As the Kalahari Desert faces a worsening dry season, prides, packs and herds of all kinds must rely on the power of family to survive.','https://image.tmdb.org/t/p/w500/c7cA49RgpTYgk7Db3XAzb8vExAD.jpg','2022-03-03',6.9,0),(20079,'The Mad Hatter','en','An eccentric professor takes four of his students to the mansion of the “Mad Hatter”, an urban legend driven insane by mercury poisoning and grief. He says that there’s nothing to worry about now: the strange, shambling “caretakers” that haunt the home are merely servants that have fallen to inbreeding, and the Hatter himself has been dead for years. But as the students start disappearing one by one, those that remain start to question if the professor’s experiment is truly scientific...and if the Hatter didn’t just succumb to his madness, but decided to spread it...','https://image.tmdb.org/t/p/w500/lTUfalNirpq7SBASa6lnzs27iam.jpg','2021-01-29',5.6,0),(20080,'The Last Survivors','en','In the near future, society collapses and water becomes scarce. When a greedy water baron starts violently clearing out survivors, Kendal, a 17-year-old teenager, fights the baron\'s henchman to keep a well open.','https://image.tmdb.org/t/p/w500/pUTps5z6OXWCvuWooQE2py417o4.jpg','2014-06-12',6.3,0),(20081,'Kangaroo Jack','en','Two childhood friends — a New York hairstylist and a wanna-be musician — get mixed-up with the mob and are forced to deliver $50,000 to Australia, but things go all wrong when the money is lost to a wild kangaroo.','https://image.tmdb.org/t/p/w500/n