lS9TCmu.jpg','2016-08-10',6.4,0),(20108,'Judge Dredd','en','In a dystopian future, Dredd, the most famous judge (a cop with instant field judiciary powers) is convicted for a crime he did not commit while his murderous counterpart escapes.','https://image.tmdb.org/t/p/w500/cfSnKn8NDU3m8UxihjVcYprA0Aq.jpg','1995-06-30',5.8,0),(20109,'xXx','en','Xander Cage is your standard adrenaline junkie with no fear and a lousy attitude. When the US Government \"recruits\" him to go on a mission, he\'s not exactly thrilled. His mission: to gather information on an organization that may just be planning the destruction of the world, led by the nihilistic Yorgi.','https://image.tmdb.org/t/p/w500/86BnliVDBo2TjKmrgQTJIPHxAKd.jpg','2002-08-09',5.9,0),(20110,'Only the Brave','en','Members of the Granite Mountain Hotshots battle deadly wildfires to save an Arizona town.','https://image.tmdb.org/t/p/w500/lC7WdUNLOJI3sllaDGNdFy2GT8g.jpg','2017-09-22',7.4,0),(20111,'West Side Story','en','Two youngsters from rival New York City gangs fall in love, but tensions between their respective friends build toward tragedy.','https://image.tmdb.org/t/p/w500/lnUxSldaVI0mYCCf2akyQpbTFgr.jpg','2021-12-08',7.1,0),(20112,'O Brother, Where Art Thou?','en','In the deep south during the 1930s, three escaped convicts search for hidden treasure while a relentless lawman pursues them. On their journey they come across many comical characters and incredible situations. Based upon Homer\'s \'Odyssey\'.','https://image.tmdb.org/t/p/w500/2YztYilviFCYcEtDAnrOstUWGie.jpg','2000-08-30',7.3,0),(20113,'The Messenger: The Story of Joan of Arc','en','In 1429 a teenage girl from a remote French village stood before her King with a message she claimed came from God; that she would defeat the world\'s greatest army and liberate her country from its political and religious turmoil. Following her mission to reclaim god\'s diminished kingdom - through her amazing victories until her violent and untimely death.','https://image.