tation to a tournament there as cover.','https://image.tmdb.org/t/p/w500/zN7OOSARMLVzl9xJqkW2CcZ3xhY.jpg','1973-08-17',7.4,0),(20300,'Black Emanuelle','it','In her first onscreen adventure, journalist/photographer Mae Jordan (known to her readers as \"Emanuelle\") travels to Africa on assignment. Questions of her own racial and sexual identity come to a head as she observes the troubled marriage of her hosts, Ann and Gianni Danieli. Matters are complicated further when Emanuelle finds herself in affairs with both of them, after which she flees Africa, only to be persued by Gianni, who had earlier rejected her and ridiculed her advances.','https://image.tmdb.org/t/p/w500/hFlfmv5oOLxmbybo2ruX7B9b514.jpg','1975-11-27',4.6,0),(20301,'Koati','en','Three unlikely heroes - Nachi, a free-spirited coati; Xochi, a fearless monarch butterfly and Pako, a hyperactive glass frog - embark on an adventure to stop wicked coral snake Zaina from destroying their rain forest homeland.','https://image.tmdb.org/t/p/w500/AbJiqVPGuPZ4RWNkT8tPnlEKe6g.jpg','2021-10-22',7.3,0),(20302,'Weird Science','en','Two unpopular teenagers, Gary and Wyatt, fail at all attempts to be accepted by their peers. Their desperation to be liked leads them to \"create\" a woman via their computer. Their living and breathing creation is a gorgeous woman, Lisa, whose purpose is to boost their confidence level by putting them into situations which require Gary and Wyatt to act like men.','https://image.tmdb.org/t/p/w500/jaEauZd2joSAKn42D83gm3S0y3F.jpg','1985-08-01',6.5,0),(20303,'Little Children','en','The lives of two lovelorn spouses from separate marriages, a registered sex offender, and a disgraced ex-police officer intersect as they struggle to resist their vulnerabilities and temptations.','https://image.tmdb.org/t/p/w500/so9xla7b7WfFiarDwOukhQpRuyd.jpg','2006-10-06',7.1,0),(20304,'Superman IV: The Quest for Peace','en','With global superpowers engaged in an increasingly hostile arms race, Superman leads a crusade to rid the world of nuclear weapons. But Lex Luthor, recently sprung from jail, is declaring war on the Man of Steel and his quest to save the planet. Using a strand of Superman\'s hair, Luthor synthesizes a powerful ally known as Nuclear Man and ignites an epic battle spanning Earth and space.','https://image.tmdb.org/t/p/w500/vhs3P0JwqzlgfBqhjnCWDEOtDmS.jpg','1987-07-24',4.5,0),(20305,'Just Short of Perfect','pt','A divorced lawyer falls for a charismatic cardiologist. But when their difference in size leads to family friction, is she ready to listen to her heart?','https://image.tmdb.org/t/p/w500/glFwaNYHhzUa1pao25O2o2aFkxj.jpg','2021-11-18',6.2,0),(20306,'Hustlers','en','A crew of savvy former strip club employees band together to turn the tables on their Wall Street clients.','https://image.tmdb.org/t/p/w500/zBhv8rsLOfpFW2M5b6wW78Uoojs.jpg','2019-09-12',6.5,0),(20307,'Paranormal Activity 4','en','It has been five years since the disappearance of Katie and Hunter, and a suburban family witness strange events in their neighborhood when a woman and a mysterious child move in.','https://image.tmdb.org/t/p/w500/na5tAslm1kGNcft083AIXMTOsYR.jpg','2012-10-17',5.4,0),(20308,'The Shallows','en','When Nancy is surfing on a secluded beach, she finds herself on the feeding ground of a great white shark. Though she is stranded only 200 yards from shore, survival proves to be the ultimate test of wills, requiring all of Nancy\'s ingenuity, resourcefulness, and fortitude.','https://image.tmdb.org/t/p/w500/42HlPJmiE6rQdtT2lYzPPMQYvqG.jpg','2016-06-24',6.4,0),(20309,'Battle for Sevastopol','ru','The story of Lyudmila Pavlichenko, the most successful female sniper in history.','https://image.tmdb.org/t/p/w500/6PXb2TxEFzmi1FbJIV0NOLdhW9M.jpg','2015-04-02',7.4,0),(20310,'Dragons Forever','cn','A hot-shot lawyer is hired by a Hong Kong chemical plant to dispose of opposition to their polluting ways. But when he falls for a beautiful woman out to stop the plant, he is torn in a