ing, he is forced to re-evaluate his behavior as he comes face-to-face with the ghosts of girlfriends past, present, and future, along with his deceased uncle. The experience changes his attitude and allows him to reconnect with his first and only love, Jenny.','https://image.tmdb.org/t/p/w500/yNn5NjNQF8m7w05Jqk2kEW2XOfU.jpg','2009-05-01',5.9,0),(20317,'The Story of O','fr','The beautiful O is taken by her boyfriend, Rene, to a bizarre retreat, where she is trained in bondage and sexual perversion...','https://image.tmdb.org/t/p/w500/25ozVaMSebid79fzJpYrmN2mbrd.jpg','1975-08-27',5.7,0),(20318,'The Princess Bride','en','In this enchantingly cracked fairy tale, the beautiful Princess Buttercup and the dashing Westley must overcome staggering odds to find happiness amid six-fingered swordsmen, murderous princes, Sicilians and rodents of unusual size. But even death can\'t stop these true lovebirds from triumphing.','https://image.tmdb.org/t/p/w500/dvjqlp2sAhUeFjUOfQDgqwpphHj.jpg','1987-09-25',7.7,0),(20319,'Renegades','en','In the midst of the Balkan wars, a squad of Navy SEALs attempts to unravel a long-forgotten mystery after discovering an enormous treasure trove hidden at the bottom of a lake in Serbia.','https://image.tmdb.org/t/p/w500/hx4nxhesaagsvJNhRw2fTobg8o.jpg','2017-08-21',5.7,0),(20320,'Iron Sky','en','In the last moments of World War II, a secret Nazi space program evaded destruction by fleeing to the Dark Side of the Moon. During 70 years of utter secrecy, the Nazis construct a gigantic space fortress with a massive armada of flying saucers.','https://image.tmdb.org/t/p/w500/hVDJM29BSbET4FzI24xLuWSmDUR.jpg','2012-03-10',5.7,0),(20321,'The World\'s End','en','Five friends who reunite in an attempt to top their epic pub crawl from 20 years earlier unwittingly become humankind\'s only hope for survival.','https://image.tmdb.org/t/p/w500/kpglnOBYmKn0AkkWDzGxzKHDbds.jpg','2013-07-18',6.8,0),(20322,'Emmanuelle in Hong Kong','cn','Yan and Emily have been married for two years. Since Emily is cultivated in a catholic way and considers sex to be a sin, their sex life is always miserable. To save their marriage, Yan hires a nobleman, K, to give Emily a lesson in sex. Yan cooks up a scheme to kidnap his wife and lock her up in a castle for three months for the tutorial. After the training, her attitude towards sex has been changed, but Yan is still unable to please his wife...','https://image.tmdb.org/t/p/w500/1s8wCKJ6jqBI4iyoSkT56WBWBel.jpg','2003-06-06',2,0),(20323,'The Hidden Face','es','A Spanish orchestra conductor deals with the mysterious disappearance of his girlfriend.','https://image.tmdb.org/t/p/w500/7aMvCD4TkQ8rKqrJiuPCJnHinrk.jpg','2011-09-16',7.3,0),(20324,'Deliver Us from Evil','en','When a frightening wave of violence sweeps through New York City, troubled cop Sarchie fails to find a rational explanation for the bizarre crimes. However, his eyes are opened to a frightening alternate reality when renegade Jesuit priest Mendoza convinces him that demonic possession may be to blame for the gruesome murders. Together, they wage a valiant supernatural struggle to rid the city of an otherworldly evil.','https://image.tmdb.org/t/p/w500/Uz32ERsyCmGwV8Eg2wmT2ooWpo.jpg','2014-07-01',6.2,0),(20325,'The Lost City of Z','en','A true-life drama in the 1920s, centering on British explorer Col. Percy Fawcett, who discovered evidence of a previously unknown, advanced civilization in the Amazon and disappeared whilst searching for it.','https://image.tmdb.org/t/p/w500/dgDVkGFltTm1MCoFtlq91r7jwi9.jpg','2017-03-15',6.4,0),(20326,'Tremors 5: Bloodlines','en','The giant, man-eating Graboids are back and even deadlier than before, terrorizing the inhabitants of a South African wildlife reserve as they attack from below-and above.','https://image.tmdb.org/t/p/w500/dlSOgB0UcsU6pr3ttGrYsytDJfC.jpg','2015-10-06',5.5,0),(20327,'Planes: Fire & Rescue','en','When world-famous air racer Dusty learns that his engine is damaged and he may never race again, he must shift gears and is launched into the world of aerial firefighting. Dusty joins forces with veteran fire and rescue helicopter Blade Ranger and his team, a bunch of all-terrain vehicles known as The Smokejumpers. Together, the fearless team battles a massive wildfire, and Dusty learns what it takes to become a true hero.','https://image.tmdb.org/t/p/w500/pOmteFeBDI9FJOPTDvYJYFeAtdp.jpg','2014-07-17',6.1,0),(20328,'Before I Go to Sleep','en','Ever since she sustained a traumatic head injury, Christine Lucas has suffered from anterograde amnesia, unable to form new memories and having forgotten the last 15 years of her life. Every morning, she becomes reacquainted with her husband, Ben, and the other constants in her life. Terrifying truths about her past begin to emerge, causing her to question everything -- and everyone -- around her.','https://image.tmdb.org/t/p/w500/1sSWpTupVixOanIpZdLGzsKvcZS.jpg','2014-09-03',6.5,0),(20329,'The Son of Bigfoot','en','Teenage outsider Adam sets out on an epic and daring quest to uncover the mystery behind his long-lost dad, only to find out that he is none other than the legendary Bigfoot! He has been hiding deep in the forest for years to protect himself and his family from HairCo., a giant corporation eager to run scientific experiments with his special DNA. As father and son start making up for lost time after the boy\'s initial disbelief, Adam soon discovers that he too is gifted with superpowers beyond his imagination. But little do they know, HairCo. is on their tail as Adam\'s traces have led them to Bigfoot!','https://image.tmdb.org/t/p/w500/5yCQvhFuFPY0pACxoUpLUlYCxop.jpg','2017-07-26',6.6,0),(20330,'Euphemia','en','Amelia is asked by her boyfriend to take a new step.','https://image.tmdb.org/t/p/w500/bF5U70L39sbJ9jc40FvZuEGpF3c.jpg','2023-02-11',0,0),(20331,'Trick \'r Treat','en','Four interwoven stories that occur on Halloween: an everyday high school principal has a secret life as a serial killer; a college virgin might have just met the one guy for her; a group of teenagers pull a mean prank, and a bitter old recluse receives an uninvited guest.','https://image.tmdb.org/t/p/w500/w0nmol4g7n6MFfhfphV7GzHHYjB.jpg','2007-10-26',7,0),(20332,'Poison Ivy','en','A seductive teen befriends an introverted high school student and schemes her way into the lives of her wealthy family.','https://image.tmdb.org/t/p/w500/igwGf0qNka1qH1HPijgbABfUfB4.jpg','1992-05-08',5.4,0),(20333,'Latte and the Magic Waterstone','de','When a greedy bear steals a magic stone to keep the forest’s water for himself, a brave hedgehog and a timid squirrel must work together to retrieve it.','https://image.tmdb.org/t/p/w500/saxPKOrN6rNScTicLpBDZw58Cw.jpg','2019-12-11',6.7,0),(20334,'The Lighthouse','en','Two lighthouse keepers try to maintain their sanity while living on a remote and mysterious New England island in the 1890s.','https://image.tmdb.org/t/p/w500/4SC4cyzHWWzDEdszdxHYPWd32YH.jpg','2019-10-18',7.5,0),(20335,'Tower Heist','en','A luxury condo manager leads a staff of workers to seek payback on the Wall Street swindler who defrauded them. With only days until the billionaire gets away with the perfect crime, the unlikely crew of amateur thieves enlists the help of petty crook Slide to steal the $20 million they’re sure is hidden in the penthouse.','https://image.tmdb.org/t/p/w500/1HcOyMODYZXnncMikfhYkw3x2ss.jpg','2011-11-02',6.1,0),(20336,'Natural Born Killers','en','Two victims of traumatized childhoods become lovers and serial murderers irresponsibly glorified by the mass media.','https://image.tmdb.org/t/p/w500/2fd7UrKcFp9xShEmDBGKHZeuWfe.jpg','1994-08-25',7.1,0),(20337,'Swan Song','en','In the near future, Cameron Turner is diagnosed with a terminal illness. Presented with an experimental solution to shield his wife and son from grief, he grapples with altering their fate.','https://image.tmdb.org/t/p/w500/y0WW5vX58oMEg9aRRTB5QtG1Vyn.jpg','2021-12-17',7.3,0),(20338,'Big Fish & Begonia','zh','Beyond the human realm, there is a magical race of beings who control the tides and the changing of the seasons. One of these beings, a young girl named Chun, seeks something more—she wants to experience the human world! At sixteen, she finally gets her chance and transforms into a dolphin in order to explore the world that has her fascinated. But she soon discovers that it\'s a dangerous place and nearly gets killed in a vortex. Luckily, her life is spared when a young boy sacrifices himself to save her. Moved by his kindness and courage, she uses magic to bring him back to life only to learn that this power comes at a serious price. On a new adventure, she’ll have to make her own sacrifices in order to protect his soul until it is ready to return to the human world.','https://image.tmdb.org/t/p/w500/fRCdXh9MZutj1JJPZlUXMex6AuB.jpg','2016-07-08',7.4,0),(20339,'Jamon Jamon','es','Jose Luis is an executive at his parents underwear factory where his girlfriend Sylvia works on the shop floor. When Sylvia becomes pregnant, Jose Luis promises her that he will marry her, most likely against the wishes of his parents. Jose Luis\' mother is determined to break her son\'s engagement to a girl from a lower-class family, and hires Raul, a potential underwear model and would-be bullfighter to seduce Sylvia.','https://image.tmdb.org/t/p/w500/wAucj0pm9eGaC8nx01pbdyvK4VS.jpg','1992-09-03',6.3,0),(20340,'Revolutionary Road','en','A young couple living in a Connecticut suburb during the mid-1950s struggle to come to terms with their personal problems while trying to raise their two children. Based on a novel by Richard Yates.','https://image.tmdb.org/t/p/w500/63PKnmHjaDcTAjZIfj6bWVN8gvw.jpg','2008-12-19',7,0),(20341,'All Saints','en','ALL SAINTS is based on the inspiring true story of salesman-turned-pastor Michael Spurlock, the tiny church he was ordered to shut down, and a group of refugees from Southeast Asia. Together, they risked everything to plant seeds for a future that might just save them all.','https://image.tmdb.org/t/p/w500/sIE5BafMU0gPYOqBSiYzTxmHqGM.jpg','2017-08-25',6.2,0),(20342,'Last Christmas','en','Kate is a young woman who has a habit of making bad decisions, and her last date with disaster occurs after she accepts work as Santa\'s elf for a department store. However, after she meets Tom there, her life takes a new turn.','https://image.tmdb.org/t/p/w500/kDEjffiKgjuGo2DRzsqfjvW0CQh.jpg','2019-11-07',7.2,0),(20343,'The Black Cauldron','en','Taran is an assistant pigkeeper with boyish dreams of becoming a great warrior. However, he has to put the daydreaming aside when his charge, an oracular pig named Hen Wen, is kidnapped by an evil lord known as the Horned King. The villain hopes Hen will show him the way to The Black Cauldron, which has the power to create a giant army of unstoppable soldiers.','https://image.tmdb.org/t/p/w500/act8vtlXVEizdsUf9FcKbzSERew.jpg','1985-07-24',6.5,0),(20344,'Fantastic Four','en','Set in the Marvel Cinematic Universe (MCU) and based on the Marvel Comics characters of the same name.','https://image.tmdb.org/t/p/w500/jatnqRPnxjg2Q6cFsAjmrBNhx9.jpg','2025-02-12',0,0),(20345,'Orca','en','After witnessing the killing of his mate and offspring at the hands of a reckless Irish captain, a vengeful killer whale rampages through the fisherman\'s Newfoundland harbor. Under pressure from the villagers, the captain, a female marine biologist and an Indigenous tribalist venture after the great beast, who will meet them on its own turf.','https://image.tmdb.org/t/p/w500/uSascD0pN3n5d6BlyFdce0hRVzz.jpg','1977-07-22',6.2,0),(20346,'The Pink Panther','en','The trademark of The Phantom, a renowned jewel thief, is a glove left at the scene of the crime. Inspector Clouseau, an expert on The Phantom\'s exploits, feels sure that he knows where The Phantom will strike next and leaves Paris for the Tyrolean Alps, where the famous Lugashi jewel \'The Pink Panther\' is going to be. However, he does not know who The Phantom really is, or for that matter who anyone else really is...','https://image.tmdb.org/t/p/w500/aCjJ0sKayks2uL7MJBzdp2i67NI.jpg','1963-12-18',6.9,0),(20347,'Scooby-Doo! Return to Zombie Island','en','Scooby-Doo and his pals win an all-expense paid vacation and embark on a trip of a lifetime to a tropical paradise. Their destination however, turns out to be Zombie Island. As soon as they arrive, they realize the place looks strangely familiar and is reminiscent of a trip they took years ago, in which they became wrapped up in a mystery involving zombies. The gang soon learns that their trip to paradise comes with a price when the zombies re-emerge and attack their hotel. Will Scooby-Doo and the Mystery Inc. gang finally solve the mystery behind Zombie Island?','https://image.tmdb.org/t/p/w500/vd0oIoWhEm8o7EpS0kV7RaV0Flf.jpg','2019-09-03',7,0),(20348,'21','en','Ben Campbell is a young, highly intelligent, student at M.I.T. who strives to succeed. Wanting a scholarship to transfer to Harvard School of Medicine to become a doctor, Ben learns that he cannot afford the $300,000 tuition as he comes from a poor, working-class background. But one evening, Ben is introduced by his unorthodox math professor to  a small but secretive club.  Students Jill, Choi, Kianna, and Fisher, who are being trained by Professor Rosa in to count cards at blackjack.','https://image.tmdb.org/t/p/w500/efG8Po57alqSlhqHU1lXJ3duG6t.jpg','2008-03-27',6.7,0),(20349,'Close to the Horizon','de','Jessica knows exactly what her life is supposed to look like and where it takes her. But then she meets Danny. He has a complicated past and could confuse all their plans. Jessica has to decide.','https://image.tmdb.org/t/p/w500/zrpTa8JxNqd87G7HIqnynp9HpUc.jpg','2019-10-10',7.9,0),(20350,'It Takes Two','en','Identical 9-year-olds from very different backgrounds: orphaned Amanda and wealthy Alyssa meet at summer camp and decide to switch places -- and play matchmaker between Alyssa\'s dad, Roger, and the kind social worker who cares for Amanda.','https://image.tmdb.org/t/p/w500/sdes5TrRbymELYLG85YIxmFb1OP.jpg','1995-11-17',6.5,0),(20351,'Wu Kong','zh','The story tells the story of Sun Wukong and Erlang Shen, who come to the Immortal Mountain to cultivate their skills. They gain friendship, experience love and ultimately betrayal, growing throughout their life journey.','https://image.tmdb.org/t/p/w500/AjfUVXVTm7ix2ehiLA19s2BrZCe.jpg','2017-07-13',7.7,0),(20352,'RRRrrrr!!!','fr','37 000 years ago, two neighboring tribes lived in peace ... not fully in peace. While the tribe clean hair flowed peaceful days by keeping to herself the secret formula shampoo, Tribe Hair Sales lamented. Its leader decided to send a spy to steal the recipe ...','https://image.tmdb.org/t/p/w500/qsGU6myn85MfqpNAxzJtxJ3VgrM.jpg','2004-01-28',6.3,0),(20353,'Casino','en','In early-1970s Las Vegas, Sam \"Ace\" Rothstein gets tapped by his bosses to head the Tangiers Casino. At first, he\'s a great success in the job, but over the years, problems with his loose-cannon enforcer Nicky Santoro, his ex-hustler wife Ginger, her con-artist ex Lester Diamond and a handful of corrupt politicians put Sam in ever-increasing danger.','https://image.tmdb.org/t/p/w500/6zEZY1htzRos2w0W3T7o7W1WJhp.jpg','1995-11-22',8,0),(20354,'All Dogs Go to Heaven','en','When a casino-owning dog named Charlie is murdered by his rival Carface, he finds himself in Heaven basically by default since all dogs go to heaven. However, since he wants to get back at his killer, he cons his way back to the living with the warning that doing that damns him to Hell. Once back, he teams with his old partner, Itchy, to prep his retaliation. He also stumbles onto an orphan girl who can talk to the animals, thus allowing him to get the inside info on the races to ensure his wins to finance his plans. However, all the while, he is still haunted by nightmares of what\'s waiting for him on the other side unless he can prove that he is worthy of Heaven again.','https://image.tmdb.org/t/p/w500/nmWh1NglDinfkHD9zCNqGWyhl7Q.jpg','1989-11-17',6.7,0),(20355,'Showgirls','en','A young drifter named Nomi arrives in Las Vegas to become a dancer. When she catches the eye of Cristal, the main attraction at the Stardust stage show, Nomi is on the brink of realizing her dreams. But as she bumps and grinds her way to the top, Nomi realizes that there is only room for one starlet on the marquee... and that either she or Cristal will have to take a fall!','https://image.tmdb.org/t/p/w500/ojcUMFpOhYuDOlIb4Ik47mBcYej.jpg','1995-09-22',5.5,0),(20356,'The Green Inferno','en','A group of student activists travel from New York City to the Amazon to save the rainforest.  However, once they arrive in this vast green landscape, they soon discover that they are not alone… and that no good deed goes unpunished.','https://image.tmdb.org/t/p/w500/dTnAYyUwp6lT0cKrt4aNujj5mdF.jpg','2013-09-08',5.7,0),(20357,'You\'re Next','en','When the Davison family comes under attack during their wedding anniversary getaway, the gang of mysterious killers soon learns that one of their victims harbors a secret talent for fighting back.','https://image.tmdb.org/t/p/w500/otcLDzDHwlCX3S0NgxOg055xGra.jpg','2011-09-10',6.6,0),(20358,'This Is the End','en','While attending a party at James Franco\'s house, Seth Rogen, Jay Baruchel and many other celebrities are faced with the apocalypse.','https://image.tmdb.org/t/p/w500/52hObtUkMNVe6s5gaX8G2siut0u.jpg','2013-06-12',6.2,0),(20359,'Tremors 2: Aftershocks','en','Those supersucking desert creatures are back --- and this time they\'re south of the border. As the creatures worm their way through the oil fields of Mexico, the only people who can wrangle them are veteran Earl Bassett and survivalist Burt Gummer. Add to that team a young punk out for cash and a fearless scientist, and the critters don\'t stand a chance.','https://image.tmdb.org/t/p/w500/meIuuXHhuDg1iUVOp8fr14XOXR1.jpg','1996-04-09',6.2,0),(20360,'Stand by Me','en','Gordie, Chris, Teddy and Vern are four friends who decide to hike to find the corpse of Ray Brower, a local teenager, who was hit by a train while plucking blueberries in the wild.','https://image.tmdb.org/t/p/w500/7QbJa6syM4ZYxtey0d7qB7bmhzb.jpg','1986-08-08',7.9,0),(20361,'Z-O-M-B-I-E-S 2','en','Zed and Addison are back at Seabrook High, where, after a groundbreaking semester, they continue to steer both their school and community toward unity. But the arrival of a new group of outsiders – mysterious werewolves – threatens to shake up the newfound peace and causes a rift in Zed and Addison’s budding romance.','https://image.tmdb.org/t/p/w500/frTwEqSMWQ27oQeuiBO5PT0ZNqq.jpg','2020-06-13',7.6,0),(20362,'Big Momma\'s House 2','en','FBI agent Malcolm Turner goes back undercover as Big Momma, a slick-talking, slam-dunking Southern granny with attitude to spare! Now this granny must play nanny to three dysfunctional upper class kids in order to spy on their computer hacked dad.','https://image.tmdb.org/t/p/w500/wlbov6pkgySqYZilZcO54f29Dg1.jpg','2006-01-26',5.7,0),(20363,'Caged','en','An African American male is imprisoned and placed in solitary confinement after being found guilty of murdering his wife, as he\'s haunted by internal demons and his dead wife, and pushed to the breaking point by an abusive female guard.','https://image.tmdb.org/t/p/w500/8NUM43rtQSt0chumXGJPvnYb01I.jpg','2021-01-26',6.6,0),(20364,'Private Lessons','en','Phillip Filmore is a naive, 15-year-old, preoccupied with sex, who develops a crush on Nicole Mallow, the new 30-something, French housekeeper and sitter to look after him when Phillip\'s father is out of town for the summer on a \"business\" trip. But Mr. Filmore\'s unscrupulous chauffeur, Lester Lewis, takes advantage of Phillip\'s crush on Nicole to hire her to seduce the youth, then draws her into a plot to fake her own death in a blackmail scheme aimed to drain Phillip\'s trust fund.','https://image.tmdb.org/t/p/w500/dTkBOgOv3tpCnfMY6kX2MCYibo3.jpg','1981-08-21',5.8,0),(20365,'Alapaap','tl','A group of friends go to a secluded town to do a short film project but when they take an addictive substance that promised to bring them to cloud nine, they get to experience hell instead.','https://image.tmdb.org/t/p/w500/gFqHrp8zrC9EshDnvQe7tcf6W8T.jpg','2022-11-18',6,0),(20366,'Seeking Justice','en','After his wife is assaulted, a husband enlists the services of a vigilante group to help him settle the score.','https://image.tmdb.org/t/p/w500/lN3O0j1DKVnwhO1h5J3utrmrBF2.jpg','2011-09-02',5.9,0),(20367,'Asterix: The Secret of the Magic Potion','fr','Following a fall during mistletoe picking, Druid Getafix decides that it is time to secure the future of the village. Accompanied by Asterix and Obelix, he undertakes to travel the Gallic world in search of a talented young druid to transmit the Secret of the Magic Potion.','https://image.tmdb.org/t/p/w500/wmMq5ypRNJbWpdhC9aPjpdx1MMp.jpg','2018-05-12',6.9,0),(20368,'Harry Potter: A History Of Magic','en','A thrilling journey through legends, belief and folklore, this film goes behind the scenes with the British Library as they search to tell that story through objects in their collection, in an ambitious new exhibition: Harry Potter: A History Of Magic.  J.K. Rowling, who is lending unseen manuscripts, drawings and drafts from her private archives (which will sit alongside treasures from the British Library, as well as original drafts and drawings from Jim Kay) talks about some of the personal items she has lent to the exhibition and gives new insight into her writing, looking at some of the objects from the exhibition that have fired her imagination.','https://image.tmdb.org/t/p/w500/geike7VgTrftxwzcvND4dRdZdAv.jpg','2017-10-28',7.2,0),(20369,'The Wall','en','An American sniper and his spotter engage in a deadly cat-and-mouse game with an Iraqi sniper.','https://image.tmdb.org/t/p/w500/8POAZwZpp24l1IgKKM8ZRAQ2kid.jpg','2017-05-12',6.3,0),(20370,'Hugo','en','Orphaned and alone except for an uncle, Hugo Cabret lives in the walls of a train station in 1930s Paris. Hugo\'s job is to oil and maintain the station\'s clocks, but to him, his more important task is to protect a broken automaton and notebook left to him by his late father. Accompanied by the goddaughter of an embittered toy merchant, Hugo embarks on a quest to solve the mystery of the automaton and find a place he can call home.','https://image.tmdb.org/t/p/w500/cFFkim9vRl250n50brtqfSvVF9k.jpg','2011-11-22',7.2,0),(20371,'The Dukes of Hazzard','en','Cousins, Bo and Luke Duke, with the help of their eye-catching cousin, Daisy and moonshine-running Uncle Jesse, try and save the family farm from being destroyed by Hazzard County\'s corrupt commissioner, Boss Hogg. Their efforts constantly find the \'Duke Boys\' eluding authorities in \'The General Lee\', their 1969 orange Dodge Charger that keeps them one step ahead of the dimwitted antics of the small southern town\'s Sheriff, Roscoe P. Coltrane.','https://image.tmdb.org/t/p/w500/o5pKtw26jEk7zX2446gPVbTNrFb.jpg','2005-08-05',5.5,0),(20372,'Leatherface: The Texas Chainsaw Massacre III','en','Two college students driving coast to coast are lured off the main highway and onto a deserted Texas road. Here they are stalked by the menacing Leatherface and his demented family...a bizarre cannibalistic clan with blood on their hands and a feast on their minds. The students’ only chance for escape is a survivalist with enough firepower to blast Leatherface and the rest of the grisly predators to hell. A depraved shocker of intense terror from the gruesome beginning to the bloody finish.','https://image.tmdb.org/t/p/w500/uALicAPXrMQm2b5C6QHa5jE9sLP.jpg','1990-01-12',5.3,0),(20373,'The Untouchables','en','Young Treasury Agent Eliot Ness arrives in Chicago and is determined to take down Al Capone, but it\'s not going to be easy because Capone has the police in his pocket. Ness meets Jim Malone, a veteran patrolman and probably the most honorable one on the force. He asks Malone to help him get Capone, but Malone warns him that if he goes after Capone, he is going to war.','https://image.tmdb.org/t/p/w500/8BquGK22zCcsmBWiaIakaaPpSZb.jpg','1987-06-03',7.8,0),(20374,'Misery','en','Novelist Paul Sheldon crashes his car on a snowy Colorado road. He is found by Annie Wilkes, the \"number one fan\" of Paul\'s heroine Misery Chastaine. Annie is also dangerously unstable, and Paul finds himself crippled, drugged, and at her mercy.','https://image.tmdb.org/t/p/w500/klPO5oh1LOxiPpdDXZo1ADgpKcw.jpg','1990-11-30',7.8,0),(20375,'Below Zero','es','When a prisoner transfer van is attacked, the cop in charge must fight those inside and outside while dealing with a silent foe: the icy temperatures.','https://image.tmdb.org/t/p/w500/oYEORVxp2ZfknTQYhEsNkv2HYss.jpg','2021-01-29',6.4,0),(20376,'Flavors of Youth','zh','The rigorous city life of China, while bustling and unforgiving, contains the everlasting memories of days past. Three stories told in three different cities, follow the loss of youth and the daunting realization of adulthood. Though reality may seem ever changing, unchangeable are the short-lived moments of one\'s childhood days. A plentiful bowl of noodles, the beauty of family and the trials of first love endure the inevitable flow of time, as three different characters explore the strength of bonds and the warmth of cherished memories. Within the disorder of the present world, witness these quaint stories recognize the comfort of the past, and attempt to revive the neglected flavors of youth.','https://image.tmdb.org/t/p/w500/ueHeH5ergeHx27L4SCI9qlmwczA.jpg','2018-08-04',6.8,0),(20377,'Sentinelle','fr','Transferred home after a traumatizing combat mission, a highly trained French soldier uses her lethal skills to hunt down the man who hurt her sister.','https://image.tmdb.org/t/p/w500/jt9NNFFAjvMouzHt06U3uANBpUm.jpg','2021-03-05',5.9,0),(20378,'Alibi.com','fr','Greg founded a company called Alibi.com that creates any type of alibi. With his associate, Augustin, and Medhi his new employee, they devise unstoppable stratagems and stagings to cover their clients. But meeting Flo, a pretty blonde who hates men who lie, will complicate Greg\'s life, which begins by hiding the true nature of his activity. During the presentation to parents, Greg understands that Gérard, the father of Flo, is also one of their clients.','https://image.tmdb.org/t/p/w500/8K5dvcXq7Lq2qiE9nkjF1Dht60R.jpg','2017-02-15',6.5,0),(20379,'Lamborghini: The Man Behind the Legend','en','Follow the launch of Lamborghini’s career as a manufacturer of tractors, a creator of military vehicles during World War II, and the designer of Lamborghini cars, which he launched in 1963 as the high-end sports car company Automobili Lamborghini.','https://image.tmdb.org/t/p/w500/RKgnYLhCNGCUkrhiCRrs40rEHe.jpg','2022-11-18',5.8,0),(20380,'Skandal! Bringing Down Wirecard','en','Upstart payment firm Wirecard wowed the financial industry with its runaway success — until a tenacious team of journalists exposed massive fraud.','https://image.tmdb.org/t/p/w500/was5Id6QbvQuUHdiYt2mwaP764k.jpg','2022-09-16',7.5,0),(20381,'Cha Cha Real Smooth','en','Fresh out of college and stuck at his New Jersey home without a clear path forward, 22-year-old Andrew begins working as a party starter for bar/bat mitzvahs—where he strikes up a unique friendship with a young mom and her teenage daughter.','https://image.tmdb.org/t/p/w500/iUvoVhvwTlP8DofoqeIu7QAGLAe.jpg','2022-06-17',7.2,0),(20382,'Species II','en','Having just returned from a mission to Mars, Commander Ross isn\'t exactly himself. He\'s slowly becoming a terrifying alien entity with one goal -- to procreate with human women! When countless women suffer gruesome deaths after bearing half-alien offspring, scientist Laura Baker and hired assassin Press Lennox use Eve, a more tempered alien clone, to find Ross and his brood. Before long Eve escapes to mate with Ross.','https://image.tmdb.org/t/p/w500/bTZOYPnbnTaeiiybtByzWkeb1Gl.jpg','1998-04-10',5.1,0),(20383,'From Dusk Till Dawn','en','Seth Gecko and his younger brother Richard are on the run after a bloody bank robbery in Texas. They escape across the border into Mexico and will be home-free the next morning, when they pay off the local kingpin. They just have to survive \'from dusk till dawn\' at the rendezvous point, which turns out to be a Hell of a strip joint.','https://image.tmdb.org/t/p/w500/sV3kIAmvJ9tPz4Lq5fuf9LLMxte.jpg','1996-01-19',7,0),(20384,'Sniper: Assassin\'s End','en','Special ops sniper Brandon Beckett and his legendary father look for a dark operative within the government, and take on Russian mercenaries and a yakuza-trained assassin.','https://image.tmdb.org/t/p/w500/AiymaaYeAl9ZBoyUz2tz4k2XaKv.jpg','2020-06-15',6.3,0),(20385,'Christmas ...Again?!','en','Rowena \"Ro\" is a high-spirited 11-year-old hoping to add more spunk to her Christmas celebrations when her parents’ divorce is going anything but smoothly.','https://image.tmdb.org/t/p/w500/89kgeIn5Cz7u8qRtyts3oyXmx8S.jpg','2021-12-03',6.7,0),(20386,'Doctor Dolittle','en','A successful physician and devoted family man, John Dolittle seems to have the world by the tail, until a long suppressed talent he possessed as a child, the ability to communicate with animals is suddenly reawakened with a vengeance! Now every creature within squawking distance wants the good doctor\'s advice, unleashing an outrageous chain of events that turns his world upside down!','https://image.tmdb.org/t/p/w500/tLrchGMIkdo1KamQJA6fwvDQEy0.jpg','1998-06-26',5.7,0),(20387,'Gerald\'s Game','en','When her husband\'s sex game goes wrong, Jessie (who is handcuffed to a bed in a remote lake house) faces warped visions, dark secrets and a dire choice.','https://image.tmdb.org/t/p/w500/32dippiypDdaKv7XFEfUlQ7kPup.jpg','2017-09-29',6.4,0),(20388,'Rain Man','en','When car dealer Charlie Babbitt learns that his estranged father has died, he returns home to Cincinnati, where he discovers that he has a savant older brother named Raymond and that his father\'s $3 million fortune is being left to the mental institution in which Raymond lives. Motivated by his father\'s money, Charlie checks Raymond out of the facility in order to return with him to Los Angeles. The brothers\' cross-country trip ends up changing both their lives.','https://image.tmdb.org/t/p/w500/iTNHwO896WKkaoPtpMMS74d8VNi.jpg','1988-12-11',7.8,0),(20389,'Elf','en','When young Buddy falls into Santa\'s gift sack on Christmas Eve, he\'s transported back to the North Pole and raised as a toy-making elf by Santa\'s helpers. But as he grows into adulthood, he can\'t shake the nagging feeling that he doesn\'t belong. Buddy vows to visit Manhattan and find his real dad, a workaholic publisher.','https://image.tmdb.org/t/p/w500/oOleziEempUPu96jkGs0Pj6tKxj.jpg','2003-10-09',6.7,0),(20390,'Brothers by Blood','en','Peter and Michael, raised on the streets of Philadelphia, are the children of Irish mob members, forever linked by the crimes of their fathers. 30 years later, Michael now runs the criminal organization and lusts for more power, his dangerous antics frequently held in check by his cautious cousin Peter. Haunted by the death of his sister, whose passing destroyed both his parents, Peter is caught between the dreams of childhood and the realities of his life as an enforcer. His only reprieve is a local boxing gym, a sanctuary that is quickly threatened as Michael’s desire for control escalates.','https://image.tmdb.org/t/p/w500/2RKGUCbo2R6IDsufxApL6nRFL4j.jpg','2021-01-22',5.8,0),(20391,'Kill Command','en','Set in a near future, technology-reliant society that pits man against killing machines. Against this backdrop an elite army unit is helicoptered to a remote, off-the-grid island training facility. What starts out as a simple training exercise for Captain Bukes and his tight-knit unit, descends into a terrifying battle to the death, as the marines discover the island is overrun by an enemy that transcends the human concept of evil.','https://image.tmdb.org/t/p/w500/xn6t1nYJaUMmudnHHiK390AORNu.jpg','2016-05-13',5.6,0),(20392,'War','ru','During the bloody war in Chechnya, a British couple and two Russian soldiers are taken hostage by Chechen rebels. Two of the hostages are then released to bring the money for the British woman who is forced to wait for the ransom.','https://image.tmdb.org/t/p/w500/uj1vANvuVgWGUwbuNwaTP215dHm.jpg','2002-03-14',7.2,0),(20393,'The Legend of Hercules','en','In Ancient Greece 1200 B.C., a queen succumbs to the lust of Zeus to bear a son promised to overthrow the tyrannical rule of the king and restore peace to a land in hardship. But this prince, Hercules, knows nothing of his real identity or his destiny. He desires only one thing: the love of Hebe, Princess of Crete, who has been promised to his own brother. When Hercules learns of his greater purpose, he must choose: to flee with his true love or to fulfill his destiny and become the true hero of his time. The story behind one of the greatest myths is revealed in this action-packed epic - a tale of love, sacrifice and the strength of the human spirit.','https://image.tmdb.org/t/p/w500/aAnRHLq50AbGWEibXHjmLbp2Tze.jpg','2014-01-10',4.8,0),(20394,'Push','en','After his father, an assassin, is brutally murdered, Nick Gant vows revenge on Division, the covert government agency that dabbles in psychic warfare and experimental drugs. Hiding in Hong Kong\'s underworld, Nick assembles a band of rogue psychics dedicated to destroying Division. Together with Cassie, a teenage clairvoyant, Nick goes in search of a missing girl and a stolen suitcase that could be the key to accomplishing their mutual goal.','https://image.tmdb.org/t/p/w500/fHStfRjQGstuqtUz4Q22lbFU58M.jpg','2009-02-04',6.1,0),(20395,'A Bad Moms Christmas','en','Amy, Kiki and Carla – three under-appreciated and over-burdened women – rebel against the challenges and expectations of the Super Bowl for mothers: Christmas. And if creating a more perfect holiday for their families wasn’t hard enough, they have to do all of that while hosting and entertaining their own mothers.','https://image.tmdb.org/t/p/w500/gPNHolu7AGnrB7r5kvJRRTfwMFR.jpg','2017-08-04',6.3,0),(20396,'Cats & Dogs: The Revenge of Kitty Galore','en','The ongoing war between the canine and feline species is put on hold when they join forces to thwart a rogue cat spy with her own sinister plans for conquest.','https://image.tmdb.org/t/p/w500/nTsZT66I4U3aS9ezLdOKacfvo8T.jpg','2010-07-28',5.2,0),(20397,'BARDO, False Chronicle of a Handful of Truths','es','A renowned Mexican journalist and documentary filmmaker living in Los Angeles, after being named the recipient of a prestigious international award, is compelled to return to his native country, unaware that this simple trip will push him to an existential limit.','https://image.tmdb.org/t/p/w500/3e6RA0CzFDC0pz5TqiRlbHcsc2n.jpg','2022-10-27',7.1,0),(20398,'Women','en','A small town detective while investigating the disappearance of a local woman comes across an unassuming Sociology professor who is hiding a secret life.','https://image.tmdb.org/t/p/w500/yTgSMm9LRXVGxfaKqmlPCcQx5RJ.jpg','2021-04-08',4.9,0),(20399,'The Great Mouse Detective','en','When the diabolical Professor Ratigan kidnaps London\'s master toymaker, the brilliant master of disguise Basil of Baker Street and his trusted sidekick Dawson try to elude the ultimate trap and foil the perfect crime.','https://image.tmdb.org/t/p/w500/9uDr7vfjCFr39KGCcqrk44Cg7fQ.jpg','1986-07-02',7,0),(20400,'Death Sentence','en','Nick Hume is a mild-mannered executive with a perfect life, until one gruesome night he witnesses something that changes him forever. Transformed by grief, Hume eventually comes to the disturbing conclusion that no length is too great when protecting his family.','https://image.tmdb.org/t/p/w500/3rdEAMh4a3pc7GO6fSkJwpt7BWX.jpg','2007-08-31',6.7,0),(20401,'Buffalo \'66','en','Billy is released after five years in prison. In the next moment, he kidnaps teenage student Layla and visits his parents with her, pretending she is his girlfriend and they will soon marry.','https://image.tmdb.org/t/p/w500/fxzXFzbSGNA52NHQCMqQiwzMIQw.jpg','1998-01-20',7.1,0),(20402,'Molly\'s Game','en','Molly Bloom, a young skier and former Olympic hopeful becomes a successful entrepreneur (and a target of an FBI investigation) when she establishes a high-stakes, international poker game.','https://image.tmdb.org/t/p/w500/83k7FXpyV3xyOwyq1W7hBO6GVJA.jpg','2017-09-20',7.1,0),(20403,'Game of Thrones: The Last Watch','en','For a year, acclaimed British filmmaker Jeanie Finlay was embedded on the set of the hit HBO series “Game of Thrones,” chronicling the creation of the show’s most ambitious and complicated season.  Debuting one week after the series 8 finale, GAME OF THRONES: THE LAST WATCH delves deep into the mud and blood to reveal the tears and triumphs involved in the challenge of bringing the fantasy world of Westeros to life in the very real studios, fields and car-parks of Northern Ireland.  Made with unprecedented access, GAME OF THRONES: THE LAST WATCH is an up-close and personal portrait from the trenches of production, following the crew and the cast as they contend with extreme weather, punishing deadlines and an ever-excited fandom hungry for spoilers.  Much more than a “making of” documentary, this is a funny, heartbreaking story, told with wit and intimacy, about the bittersweet pleasures of what it means to create a world – and then have to say goodbye to it.','https://image.tmdb.org/t/p/w500/tVyKpOYDtKzs4SOYCbZn4YNFWHI.jpg','2019-05-26',7.1,0),(20404,'Universal Soldier','en','An American soldier who had been killed during the Vietnam War is revived 25 years later by the military as a semi-android, UniSols, a high-tech soldier of the future. After the failure of the initiative to erase all the soldier\'s 