lks of life endure a Saturday detention under a power-hungry principal. The disparate group includes rebel John, princess Claire, outcast Allison, brainy Brian and Andrew, the jock. Each has a chance to tell his or her story, making the others see them a little differently -- and when the day ends, they question whether school will ever be the same.','https://image.tmdb.org/t/p/w500/9nai8pRm4Ja0O265Qp6UyqXlLQ8.jpg','1985-02-15',7.8,0),(20442,'The Marine 3: Homefront','en','A Marine must do whatever it takes to save his kidnapped sister and stop a terrorist attack masterminded by a radical militia group.','https://image.tmdb.org/t/p/w500/9liEU1O0GZIZXYf9SekjH5kb8bb.jpg','2013-03-05',6.2,0),(20443,'Infinity Pool','en','While staying at an isolated island resort, James and Em are enjoying a perfect vacation of pristine beaches, exceptional staff, and soaking up the sun. But guided by the seductive and mysterious Gabi, they venture outside the resort grounds and find themselves in a culture filled with violence, hedonism, and untold horror.','https://image.tmdb.org/t/p/w500/yaWdCgTNnEaVrR32C3hS3MBCV3C.jpg','2023-01-27',6.7,0),(20444,'Unbroken','en','A chronicle of the life of Louis Zamperini, an Olympic runner who was taken prisoner by Japanese forces during World War II.','https://image.tmdb.org/t/p/w500/djETrCXW11Fb5hEl7vvc3bfs3oc.jpg','2014-12-25',7.4,0),(20445,'Rough Night','en','Five best friends from college reunite 10 years later for a wild bachelorette weekend in Miami. Their hard partying takes a hilariously dark turn when they accidentally kill a male stripper. Amidst the craziness of trying to cover it up, they\'re ultimately brought closer together when it matters most.','https://image.tmdb.org/t/p/w500/ttC00xcQ5UIO04kU8y0h5OAIYYJ.jpg','2017-06-15',5.7,0),(20446,'Science Fiction Volume One: The Osiris Child','en','Set in the future in a time of interplanetary colonization, an unlikely pair race against an impending global crisis and are confronted by the mon