,0),(20452,'State of Play','en','When a congressional aide is killed, a Washington, D.C. journalist starts investigating the case involving the Representative, his old college friend.','https://image.tmdb.org/t/p/w500/4f8nhHESDhAVKow2M1khmqDdatp.jpg','2009-04-17',6.8,0),(20453,'Teen Titans: Trouble in Tokyo','en','America\'s coolest heroes, the Teen Titans, go to Tokyo to track down the mysterious Japanese criminal Brushogun.','https://image.tmdb.org/t/p/w500/uUIczHTpnBDC6Mbp0dFGDZldcc1.jpg','2006-09-15',7.8,0),(20454,'Son','en','When a young boy contracts a mysterious illness, his mother must decide how far she will go to protect him from terrifying forces in her past.','https://image.tmdb.org/t/p/w500/4fl6EdtMp6p0RKJgESdFti1J3dC.jpg','2021-03-18',6.1,0),(20455,'Movie 43','en','Fifteen directors and an all-star cast created this twisted comedy that follows three teens on the hunt for the world\'s most banned film.','https://image.tmdb.org/t/p/w500/uYa06GxHsCsELx9vOQ11vsT0Aa6.jpg','2013-01-01',4.6,0),(20456,'Arthur Christmas','en','Each Christmas, Santa and his vast army of highly trained elves produce gifts and distribute them around the world in one night. However, when one of 600 million children to receive a gift from Santa on Christmas Eve is missed, it is deemed ‘acceptable’ to all but one—Arthur. Arthur Claus is Santa’s misfit son who executes an unauthorised rookie mission to get the last present half way around the globe before dawn on Christmas morning.','https://image.tmdb.org/t/p/w500/sPCrGLdTMn0ud3oAJG37VDxpQfZ.jpg','2011-11-10',6.8,0),(20457,'King Kong','en','Adventurous filmmaker, Carl Denham, sets out to produce a motion picture unlike anything the world has seen before. Alongside his leading lady Ann Darrow and his first mate Jack Driscoll, they arrive on an island and discover a legendary creature said to be neither beast nor man. Denham captures the monster to displayed on Broadway as Kong, the eighth wonder of the world.','https://image.tmdb.org/