 group members find themselves stranded, only to discover that they are not alone.','https://image.tmdb.org/t/p/w500/9AKhThGA8IATBy3gR7I4dw9SEc4.jpg','2012-05-24',5.2,0),(20496,'Operation Mekong','zh','Chinese narco-cops take their mission to the Golden Triangle following the Mekong River massacre of innocent fishermen by the region\'s drug lord.','https://image.tmdb.org/t/p/w500/wghFabaZgRorsMQWuPtKUlzq4W1.jpg','2016-09-30',7,0),(20497,'Wonder Woman: Bloodlines','en','Wonder Woman tries to help a troubled young girl who has fallen in with a deadly organization known as Villainy, Inc.','https://image.tmdb.org/t/p/w500/w1SBqj0fn1j72ST5i1jauWo3swT.jpg','2019-10-04',7,0),(20498,'Damage','en','The life of a respected British politician at the height of his career crumbles when he becomes obsessed with his son\'s lover.','https://image.tmdb.org/t/p/w500/rKEm4XPJHTjh3kCtJKw07hda6VQ.jpg','1992-12-02',6.7,0),(20499,'Vanilla Sky','en','David Aames has it all: wealth, good looks and gorgeous women on his arm. But just as he begins falling for the warmhearted Sofia, his face is horribly disfigured in a car accident. That\'s just the beginning of his troubles as the lines between illusion and reality, between life and death, are blurred.','https://image.tmdb.org/t/p/w500/l1MBK6BUkZtjEqceEMubDUtvvK3.jpg','2001-01-22',6.8,0),(20500,'Transcendence','en','Two leading computer scientists work toward their goal of Technological Singularity,  as a radical anti-technology organization fights to prevent them from creating a world where computers can transcend the abilities of the human brain.','https://image.tmdb.org/t/p/w500/qmOKJWl3wnXDcLhjtJHnCCCvAiO.jpg','2014-04-16',6,0),(20501,'Alexander','en','Alexander, the King of Macedonia, leads his legions against the giant Persian Empire. After defeating the Persians, he leads his army across the then known world, venturing farther than any westerner had ever gone, all the way to India.','https://image.tmdb.org/t/p/w500/jrwQu72sGwGqwE8Ijne89PSIvhp.jpg','2004-11-21',5.9,0),(20502,'Zombie Wars','en','Fifty years after a world-wide zombie epidemic had begun, a small group of rebel soldiers learn that intelligent zombies have begun breeding humans for food. The soldiers plan an all-out war to rid the Earth of the flesh-eating monsters for good, as the rest of the surviving world\'s population struggles to survive against the zombie hordes.','https://image.tmdb.org/t/p/w500/wpp6Z3awLYs4oZxU2ygi3aZAsEo.jpg','2007-10-31',4.1,0),(20503,'Renfield','en','Having grown sick and tired of his centuries as Dracula\'s lackey, Renfield finds a new lease on life — and maybe even redemption — when he falls for feisty, perennially angry traffic cop Rebecca Quincy.','https://image.tmdb.org/t/p/w500/p6yUjhvNGQpFZilKwOKbxQ1eHlo.jpg','2023-04-06',0,0),(20504,'House of 1000 Corpses','en','Two teenage couples traveling across the backwoods of Texas searching for urban legends of serial killers end up as prisoners of a bizarre and sadistic backwater family of serial killers.','https://image.tmdb.org/t/p/w500/afISpRBO81uaLy5hrMHqyof6C1J.jpg','2003-04-11',6.2,0),(20505,'Paul Blart: Mall Cop 2','en','Security guard Paul Blart is headed to Las Vegas to attend a Security Guard Expo with his teenage daughter Maya before she departs for college. While at the convention, he inadvertently discovers a heist - and it\'s up to Blart to apprehend the criminals.','https://image.tmdb.org/t/p/w500/59NF8vsPV84KLhsWBH7rHZbLpDN.jpg','2015-04-16',5.2,0),(20506,'Okja','en','A young girl named Mija risks everything to prevent a powerful, multi-national company from kidnapping her best friend - a massive animal named Okja.','https://image.tmdb.org/t/p/w500/pHlRr2MfjK77VIIAO7p0R4jhsJI.jpg','2017-06-28',7.4,0),(20507,'The Game','en','In honor of his birthday, San Francisco banker Nicholas Van Orton, a financial genius and a cold-hearted loner, receives an unusual present from his younger brother, Conrad: a gift certificate to play a unique kind of game. In nary a nanosecond, Nicholas finds himself consumed by a dangerous set of ever-changing rules, unable to distinguish where the charade ends and reality begins.','https://image.tmdb.org/t/p/w500/4UOa079915QjiTA2u5hT2yKVgUu.jpg','1997-09-12',7.6,0),(20508,'Into the White','no','Based on a true story. On 27 April 1940, Luftwaffe pilot Horst Schopis\' Heinkel 111 bomber is shot down near Grotli by an RAF Blackburn Skua L2940 fighter, which then crash-lands. The surviving German and English crew members begin to at shoot each other, but later find themselves huddled up in the same cabin. In order to survive the harsh winter in the Norwegian wilderness, they have to stand together. An unlikely, lifelong friendship blossoms.','https://image.tmdb.org/t/p/w500/glnBVGMFpwFfdtKbqZRBUrouJmU.jpg','2012-03-09',6.9,0),(20509,'J. Edgar','en','As the face of law enforcement in the United States for almost 50 years, J. Edgar Hoover was feared and admired, reviled and revered. But behind closed doors, he held secrets that would have destroyed his image, his career, and his life.','https://image.tmdb.org/t/p/w500/hWHFPhGvCvfHbZCxJSR3n6GsXIf.jpg','2011-11-09',6.2,0),(20510,'How the Grinch Stole Christmas!','en','Bitter and hateful, the Grinch is irritated at the thought of a nearby village having a happy time celebrating Christmas. Disguised as Santa Claus, with his dog made to look like a reindeer, he decides to raid the village to steal all the Christmas things.','https://image.tmdb.org/t/p/w500/7ir0iRuPK9OEuH569cp0nF5CJce.jpg','1966-12-18',7.5,0),(20511,'Bound','en','Corky, a tough female ex-convict working on an apartment renovation in a Chicago building, meets a couple living next door, Caesar, a paranoid mobster, and Violet, his seductive girlfriend, who is immediately attracted to her.','https://image.tmdb.org/t/p/w500/9qAy6UWVw44dGrsyKrdEMt5qIUM.jpg','1996-09-13',7.2,0),(20512,'Get Rich or Die Tryin\'','en','A tale of an inner city drug dealer who turns away from crime to pursue his passion, rap music.','https://image.tmdb.org/t/p/w500/aaEJu8vFKtrAoSRtw3xjCf1aM5d.jpg','2005-11-09',6.8,0),(20513,'Midnight in Paris','en','A romantic comedy about a family traveling to the French capital for business. The party includes a young engaged couple forced to confront the illusion that a life different from their own is better.','https://image.tmdb.org/t/p/w500/4wBG5kbfagTQclETblPRRGihk0I.jpg','2011-05-11',7.5,0),(20514,'Shoot \'Em Up','en','A man named Mr. Smith delivers a woman\'s baby during a shootout, and is then called upon to protect the newborn from the army of gunmen.','https://image.tmdb.org/t/p/w500/pbHpZfjzF4hKomaSmSZWRWKhO0P.jpg','2007-07-26',6.4,0),(20515,'Cici','tr','A family migrates to the city after a tragic loss. When they reunite in their hometown 30 years later, buried emotions and painful secrets resurface.','https://image.tmdb.org/t/p/w500/hzB4hGHkW4NGnjhqTSyTj9AbgGO.jpg','2022-10-27',5.8,0),(20516,'Scooby-Doo! in Where\'s My Mummy?','en','Scooby-Doo and the Mystery Inc. gang become involved in a supernatural mystery in Egypt.','https://image.tmdb.org/t/p/w500/svtAzhRb4ueCLXZX8r3whHrE5x3.jpg','2005-12-13',7.5,0),(20517,'The Killing of a Sacred Deer','en','Dr. Steven Murphy is a renowned cardiovascular surgeon who presides over a spotless household with his wife and two children. Lurking at the margins of his idyllic suburban existence is Martin, a fatherless teen who insinuates himself into the doctor\'s life in gradually unsettling ways.','https://image.tmdb.org/t/p/w500/e4DGlsc9g0h5AyoyvvAuIRnofN7.jpg','2017-10-20',7,0),(20518,'Ben 10: Destroy All Aliens','en','Based on the original animated series Ben 10.  Ben becomes targeted by an evil Mechamorph Warrior, named \"Retaliator,\" who mistakenly blames Ben for something he did not do and attempts to destroy all aliens.','https://image.tmdb.org/t/p/w500/qoILNllyC6YXHyT4V9YOhMJlPuO.jpg','2012-03-11',6,0),(20519,'Emily','en','The imagined life of one of the world’s most famous authors, Emily Brontë, as she finds her voice and writes the literary classic Wuthering Heights. Explore the relationships that inspired her – her raw, passionate sisterhood with Charlotte and Anne; her first aching, forbidden love for Weightman and her care for her maverick brother whom she idolises.','https://image.tmdb.org/t/p/w500/tgVBMIiJczfBWINRRd9yxE8ESln.jpg','2022-10-14',7.2,0),(20520,'The Howling','en','After a bizarre and near fatal encounter with a serial killer, a newswoman is sent to a rehabilitation center whose inhabitants may not be what they seem.','https://image.tmdb.org/t/p/w500/dEFMku7o825YhyUEHSlkvLDz1Dt.jpg','1981-01-21',6.6,0),(20521,'David and the Elves','pl','Christmas is drawing near, but it’s not a happy time for David. After moving to a big city, his parents have been bogged down with work and forgotten the meaning of Christmas. David decides to change that. Together with Albert the Elf, who escaped from the land of Santa to figure out what Christmas is all about, David sets off to Tatra Mountains, where his grandparents live, on a journey full of adventures.','https://image.tmdb.org/t/p/w500/gdQml1N2kysb1wKAGqTu3ZuQADW.jpg','2021-12-06',6,0),(20522,'Die neuen Abenteuer des Sanitätsgefreiten Neumann','de','At the end of the war, medical orderly Neumann finds himself in a remote barracks. The squad is lined up and waiting for new adventures. It\'s a good thing that the medical orderly has his contacts and can lure women into the barracks without attracting attention. And already it is called: All hands to the attack!','https://image.tmdb.org/t/p/w500/yZxouH2zfjVYAViW630FNyiSpZl.jpg','1978-01-26',7.5,0),(20523,'A Monster in Paris','fr','Paris, 1910. Emile, a shy movie projectionist, and Raoul, a colourful inventor, find themselves embarked on the hunt for a monster terrorizing citizens. They join forces with Lucille, the big-hearted star of the Bird of Paradise cabaret, an eccentric scientist and his irascible monkey to save the monster, who turns out to be an oversized but harmless flea, from the city\'s ruthlessly ambitious police chief.','https://image.tmdb.org/t/p/w500/jerM6xBeRfIr2rLg2pICmduzoyf.jpg','2011-10-12',6.8,0),(20524,'We Bought a Zoo','en','Benjamin has lost his wife and, in a bid to start his life over, purchases a large house that has a zoo – welcome news for his daughter, but his son is not happy about it. The zoo is in need of renovation and Benjamin sets about the work with the head keeper and the rest of the staff, but, the zoo soon runs into financial trouble.','https://image.tmdb.org/t/p/w500/dcOvIqdsojUdAtWt1nPT9xS76Su.jpg','2011-12-08',6.7,0),(20525,'Cadaver','no','In the aftermath of a nuclear disaster, a starving family find hope in a charismatic hotel owner. Lured by the prospect of a free dinner, they discover that the evening\'s entertainment blurs the lines between performance and reality. Will they wind up the spectators or the spectacle?','https://image.tmdb.org/t/p/w500/bo94ZQ0SlFRHL3fGPHNBYQDlnhl.jpg','2020-10-22',5.6,0),(20526,'My Extraordinary Summer with Tess','nl','As the youngest of the family, Sam is haunted by the notion that someday he could become the last remaining survivor, all alone. On a family vacation at the beach, he meets the unconventional Tess, who carries her own secrets around with her and shows him how the present moment can win out over memories and anxiety about what’s yet to come.','https://image.tmdb.org/t/p/w500/pjeM7XdPnTuA7DszfSEA0ANsSmn.jpg','2019-07-03',7.2,0),(20527,'The Haunting in Connecticut','en','When the Campbell family moves to upstate Connecticut, they soon learn that their charming Victorian home has a disturbing history: not only was the house a transformed funeral parlor where inconceivable acts occurred, but the owner\'s clairvoyant son Jonah served as a demonic messenger, providing a gateway for spiritual entities to crossover.','https://image.tmdb.org/t/p/w500/dTfL0YbTa7S59vZYmWbk6UofHkI.jpg','2009-03-27',6.2,0),(20528,'The Specialist','en','May Munro is a woman obsessed with getting revenge on the people who murdered her parents when she was still a girl. She hires Ray Quick, a retired explosives expert to kill her parent\'s killers. When Ned Trent, embittered ex-partner of Quick\'s is assigned to protect one of Quick\'s potential victims, a deadly game of cat and mouse ensues.','https://image.tmdb.org/t/p/w500/ifqrivWPQ0ZpwnIXBjgN261SQ1S.jpg','1994-10-07',5.9,0),(20529,'Vacancy','en','A young married couple becomes stranded at an isolated motel and find hidden video cameras in their room. They realize that unless they escape, they\'ll be the next victims of a snuff film.','https://image.tmdb.org/t/p/w500/1DdfXaXzi1sJysZ800GOUAwlLR4.jpg','2007-04-20',6.2,0),(20530,'Awakenings','en','Dr. Malcolm Sayer, a shy research physician, uses an experimental drug to \"awaken\" the catatonic victims of a rare disease. Leonard is the first patient to receive the controversial treatment. His awakening, filled with awe and enthusiasm, proves a rebirth for Sayer too, as the exuberant patient reveals life\'s simple but unutterably sweet pleasures to the introverted doctor.','https://image.tmdb.org/t/p/w500/9gztZXuHLG6AJ0fgqGd7Q43cWRI.jpg','1990-12-04',7.8,0),(20531,'Fast & Furious','en','When a crime brings them back to L.A., fugitive ex-con Dom Toretto reignites his feud with agent Brian O\'Conner. But as they are forced to confront a shared enemy, Dom and Brian must give in to an uncertain new trust if they hope to outmaneuver him. And the two men will find the best way to get revenge: push the limits of what\'s possible behind the wheel.','https://image.tmdb.org/t/p/w500/AmY8rE2HzWzZs5S81CygXXYDjki.jpg','2009-04-02',6.7,0),(20532,'Kung Fu Panda: Secrets of the Scroll','en','As Po looks for his lost action figures, the story of how the panda inadvertently helped create the Furious Five is told.','https://image.tmdb.org/t/p/w500/giZ4VFIG1DVeHUcJKCbtcRLM43b.jpg','2016-01-05',6.8,0),(20533,'The Animatrix','en','Straight from the creators of the groundbreaking Matrix trilogy, this collection of short animated films from the world\'s leading anime directors fuses computer graphics and Japanese anime to provide the background of the Matrix universe and the conflict between man and machines. The shorts include Final Flight of the Osiris, The Second Renaissance, Kid\'s Story, Program, World Record, Beyond, A Detective Story and Matriculated.','https://image.tmdb.org/t/p/w500/g52SOsTvdjzY8oPIn5znLJMzLHG.jpg','2003-05-09',7.2,0),(20534,'Blue Valentine','en','Dean and Cindy live a quiet life in a modest neighborhood. They appear to have the world at their feet at the outset of the relationship. However, his lack of ambition and her retreat into self-absorption cause potentially irreversible cracks in their marriage.','https://image.tmdb.org/t/p/w500/dc8BdKnDY5Iy28KzUGtHIXuqqFK.jpg','2010-12-16',6.9,0),(20535,'M3GAN 2.0','en','','https://image.tmdb.org/t/p/w500/42ePyLz2MaMdknjdZ8JA1yAvNGS.jpg','2025-01-17',0,0),(20536,'The Physician','en','England, 1021. Rob Cole, a boy born in a miserable mining town, swears to become a physician and vanquish disease and death. His harsh path of many years, a quest for knowledge besieged by countless challenges and sacrifices, leads him to the remote Isfahan, in Persia, where he meets Ibn Sina, the greatest healer of his time.','https://image.tmdb.org/t/p/w500/6koFQEuyZKNYcBMSVEHYtAeIpUE.jpg','2013-12-25',7.3,0),(20537,'Dirty Sexy Saint','en','Clay Kincaid hates the nickname \'Saint\', he got for being too kind to stray animals and desperate people. Especially when it comes to women. With a rough and damaged past that has left him jaded, he doesn\'t do committed relationships. This is before he meets Samantha Jamieson, an heiress turned runaway in need of help. When she starts to work as a waitress at his bar, he discovers that she is someone truly special and amazing… someone that could warm his damaged heart.','https://image.tmdb.org/t/p/w500/x96lVzJuFqGinfsG0EcwYwBmuom.jpg','2019-12-08',6.4,0),(20538,'Unfriended: Dark Web','en','​When a 20-something finds a cache of hidden files on his new laptop, he and his friends are unwittingly thrust into the depths of the dark web. They soon discover someone has been watching their every move and will go to unimaginable lengths to protect the dark web.','https://image.tmdb.org/t/p/w500/nOXuOeD07nZPT29IgiGT0S8PZH.jpg','2018-07-19',6.3,0),(20539,'Outlander','en','During the reign of the Vikings, a man from another world crash-lands on Earth, bringing with him an alien predator. The man must fuse his advanced technology with the weaponry of the vikings to fight the monster.','https://image.tmdb.org/t/p/w500/4vIc5fznKsQjE4d0H3H4Zy5bn9o.jpg','2008-04-24',6.4,0),(20540,'Solomon and Sheba','en','Under the rule of King David, Israel is united and prosperous although surrounded by enemies including Egypt and its allies. The aging King David favors his younger son, Solomon, as his successor, but David\'s  elder son Prince Adonijah, a warrior, declares himself King. When David learns of this, he publicly announces Solomon to be his successor. Adonijah and Joab, his general, withdraw in rage. Israel prospers under King Solomon\'s wise and benevolent rule and is seen as a threat to more tyrannical monarchs in the region. The Pharaoh of Egypt agrees to cede a Red Sea port to the Queen of Sheba in a plot to undermine Solomon\'s rule. Sheba is to seduce Solomon and introduce Sheban pagan worship into Jerusalem. Meanwhile, Prince Adonijah, now banished, also conspires with Pharaoh and is given an army to defeat Solomon. The film is a highly fictionalized dramatization of events depicted in The Bible -- First Kings chapter 10 and Second Chronicles chapter 9.','https://image.tmdb.org/t/p/w500/sQPLRT014vOADFyvh54TpXFyBPZ.jpg','1959-12-25',6.3,0),(20541,'Air Force One','en','Russian terrorists conspire to hijack the aircraft with the president and his family on board. The commander in chief finds himself facing an impossible predicament: give in to the terrorists and sacrifice his family, or risk everything to uphold his principles - and the integrity of the nation.','https://image.tmdb.org/t/p/w500/juRFEbyx5JlNuYrZM50vcZmtN78.jpg','1997-07-25',6.4,0),(20542,'U.S. Marshals','en','U.S. Marshal Sam Gerard is accompanying a plane load of convicts from Chicago to New York. The plane crashes spectacularly, and Mark Sheridan escapes. But when Diplomatic Security Agent John Royce is assigned to help Gerard recapture Sheridan, it becomes clear that Sheridan is more than just another murderer.','https://image.tmdb.org/t/p/w500/5ST0BydDSXtW5AtfDDhTVS13pTt.jpg','1998-03-06',6.5,0),(20543,'Satan\'s Slaves','id','After the death of Rini\'s mother, something is disturbing her family.','https://image.tmdb.org/t/p/w500/k16xOaI9x5fqepxVwBwUJAozsW8.jpg','2017-09-28',6.8,0),(20544,'Double Vision','zh','An FBI Agent pairs with a troubled Taiwan cop to hunt for a serial killer who\'s embedding a mysterious fungus in the brains of victims.','https://image.tmdb.org/t/p/w500/djoTRFqiVTwfsbbmYrJCeNvwlTa.jpg','2002-10-17',6.7,0),(20545,'The Deer Hunter','en','A group of working-class friends decide to enlist in the Army during the Vietnam War and finds it to be hellish chaos -- not the noble venture they imagined. Before they left, Steven married his pregnant girlfriend -- and Michael and Nick were in love with the same woman. But all three are different men upon their return.','https://image.tmdb.org/t/p/w500/bbGtogDZOg09bm42KIpCXUXICkh.jpg','1978-03-09',8,0),(20546,'Home Alone: The Holiday Heist','en','8-year-old Finn is terrified to learn his family is relocating from sunny California to Maine in the scariest house he has ever seen! Convinced that his new house is haunted, Finn sets up a series of elaborate traps to catch the “ghost” in action. Left home alone with his sister while their parents are stranded across town, Finn’s traps catch a new target – a group of thieves who have targeted Finn’s house.','https://image.tmdb.org/t/p/w500/6JPrRC0JPM06y17pUXD6w1xMvKi.jpg','2012-11-25',5.2,0),(20547,'The Taking of Deborah Logan','en','What starts as a poignant medical documentary about Deborah Logan\'s descent into Alzheimer\'s disease and her daughter\'s struggles as caregiver degenerates into a maddening portrayal of dementia at its most frightening, as hair-raising events begin to plague the family and crew and an unspeakable malevolence threatens to tear the very fabric of sanity from them all.','https://image.tmdb.org/t/p/w500/77i7EBUyQKOUiZeYQ5tWDGQb0AI.jpg','2014-10-21',6.4,0),(20548,'Mars Needs Moms','en','When Martians suddenly abduct his mom, mischievous Milo rushes to the rescue and discovers why all moms are so special.','https://image.tmdb.org/t/p/w500/g94LNU4pipIUJLkTvYIgNGfT2J2.jpg','2011-03-09',6,0),(20549,'Snoopy Presents: For Auld Lang Syne','en','After finding out her grandmother won\'t be visiting for Christmas, Lucy decides to cheer herself up by throwing the ultimate New Year\'s Eve party. Meanwhile, Charlie Brown tries to fulfill one of his resolutions before the clock strikes midnight.','https://image.tmdb.org/t/p/w500/p0ONYt2cw0vPEnZIoOHq1Ki7Ifm.jpg','2021-12-09',7.3,0),(20550,'Step Brothers','en','Brennan Huff and Dale Doback might be grown men. But that doesn\'t stop them from living at home and turning into jealous, competitive stepbrothers when their single parents marry. Brennan\'s constant competition with Dale strains his mom\'s marriage to Dale\'s dad, leaving everyone to wonder whether they\'ll ever see eye to eye.','https://image.tmdb.org/t/p/w500/jV0eDViuTRf9cmj4H0JNvbvaNbR.jpg','2008-07-25',6.6,0),(20551,'The Terminal','en','Viktor Navorski is a man without a country; his plane took off just as a coup d\'etat exploded in his homeland, leaving it in shambles, and now he\'s stranded at Kennedy Airport, where he\'s holding a passport that nobody recognizes. While quarantined in the transit lounge until authorities can figure out what to do with him, Viktor simply goes on living – and courts romance with a beautiful flight attendant.','https://image.tmdb.org/t/p/w500/vRYbjHs129MARMq1VDbnk9Jboen.jpg','2004-06-17',7.3,0),(20552,'Tron','en','When brilliant video game maker Flynn hacks the mainframe of his ex-employer, he is beamed inside an astonishing digital world...and becomes part of the very game he is designing. In his mission through cyberspace, Flynn matches wits with a maniacal Master Control Program and teams up with Tron, a security measure created to bring balance to the digital environment.','https://image.tmdb.org/t/p/w500/zwSFEczP7AzqugAHHIX3zHniT0t.jpg','1982-07-09',6.7,0),(20553,'Are We There Yet?','en','The fledgling romance between Nick, a playboy bachelor, and Suzanne, a divorced mother of two, is threatened by a particularly harrowing New Years Eve. When Suzanne\'s work keeps her in Vancouver for the holiday, Nick offers to bring her kids to the city from Portland, Oregon. The kids, who have never liked any of the men their mom dates, are determined to turn the trip into a nightmare for Nick.','https://image.tmdb.org/t/p/w500/z7MWaPlkKGMrEjbvKOa9rXH4rPg.jpg','2005-01-20',5.6,0),(20554,'Last Action Hero','en','Following the death of his father, young Danny Madigan takes comfort in watching action movies featuring the indestructible Los Angeles cop Jack Slater. After being given a magic ticket by theater manager Nick, Danny is sucked into the screen and bonds with Slater. When evil fictional villain Benedict gets his hands on the ticket and enters the real world, Danny and Jack must follow and stop him.','https://image.tmdb.org/t/p/w500/yTfjHPqh7C7bkfMtEKx2mPdorQw.jpg','1993-06-18',6.4,0),(20555,'The No Man Zone. The Movie','ru','What will happen if, as a result of biological warfare, almost the entire male population dies out? Women will grieve (for a short time), and then they will unite and create a new better world - with eco-towns, renewable energy, opportunities to do whatever they want, even science and biohacking, even yoga and self-development. Reproduction now occurs by artificial insemination, and only girls are born in the new world. But not everyone likes such a world order. Some of the surviving men and women loyal to them go to live in abandoned cities, begin to steal electricity, enjoying freedom and traditional sex. The tranquility of the ideally arranged female world is threatened when teacher Rada from the eco-city \"Two Hills\" meets the young \"primate\" Hera outside it.','https://image.tmdb.org/t/p/w500/qPljeoqEW4cBfsU1DwBDTd6Xdor.jpg','2022-06-09',7.3,0),(20556,'Resurrection','en','A woman’s carefully constructed life is upended when an unwelcome shadow from her past returns, forcing her to confront the monster she’s evaded for two decades.','https://image.tmdb.org/t/p/w500/kfRr8Jm1gaEnLTXCIfHkSw8QW6t.jpg','2022-07-29',6.2,0),(20557,'The Dark and the Wicked','en','On a secluded farm in a nondescript rural town, a man is slowly dying. His family gathers to mourn, and soon a darkness grows, marked by waking nightmares and a growing sense that something evil is taking over the family.','https://image.tmdb.org/t/p/w500/y63Sa7F2YFQPDSNQpS45p1iwTJ1.jpg','2020-10-29',6.1,0),(20558,'Superhero Movie','en','The team behind Scary Movie takes on the comic book genre in this tale of Rick Riker, a nerdy teen imbued with superpowers by a radioactive dragonfly. And because every hero needs a nemesis, enter Lou Landers, aka the villainously goofy Hourglass.','https://image.tmdb.org/t/p/w500/f3gFb4wLwNGQcpweamVhjNBdJ58.jpg','2008-03-28',5.2,0),(20559,'Insolation','en','It is a hot Sunday by the lake. His father is fishing, his mother is sunbathing, and Irvine envisions a magnificent death for himself','https://image.tmdb.org/t/p/w500/iJm1E9cN49SRmv7bTx0NDjKmGWf.jpg','2014-09-18',0,0),(20560,'Sky Sharks','en','A team of Arctic geologists stumble across an abandoned laboratory in which the Nazis developed an incredible and brutal secret weapon during the final months of WW2. Deep in the ice, they accidentally awake a deadly army of flying zombie sharks ridden by genetically mutated, undead super-humans, who are unleashed into the skies, wreaking their bloodthirsty revenge on any aircraft that takes to the air. An elite task force is assembled to take on this deadly threat and stop the Sky Sharks from conquering the air, but as time runs out, the task force realises they will have to fight fire with fire, and the stage is set for the greatest flying super-mutant zombie shark air battle the world has ever seen....','https://image.tmdb.org/t/p/w500/ne2xAzlgSaWvBrYGw2LkO8W5pHi.jpg','2020-10-07',5,0),(20561,'Mr. Nobody','en','Nemo Nobody leads an ordinary existence with his wife and 3 children; one day, he wakes up as a mortal centenarian in the year 2092.','https://image.tmdb.org/t/p/w500/qNkIONc4Rgmzo23ph7qWp9QfVnW.jpg','2009-11-06',7.8,0),(20562,'Animal House','en','At a 1962 College, Dean Vernon Wormer is determined to expel the entire Delta Tau Chi Fraternity, but those troublemakers have other plans for him.','https://image.tmdb.org/t/p/w500/1iYG1mu8dPIXPzUBZF4OE1KUMMl.jpg','1978-07-27',7,0),(20563,'Erotic Passion','el','Since her parents\' death, 19-year old Della lives with her aunt Marsha and Andrew, her old husband. One morning Marsha has sex with Alex, her husband\'s doctor. Right afterwords, Della seduces him at the beach while Marsha watches them from her window. The two women have a fight which results to Della leaving the house. She finds refuge at Maria\'s (a friend of hers) place but as it appears she is missing and the house is inhabited by Aris and Samantha. Della makes a pass at Aris, managing to infuriate Samantha. In the meanwhile, the local authorities are investigating the murder of Aris\' business partner, Steve Brynner. When all trace leads to Aris, Della suggests a swap: She\'ll travel to Italy to get fake passports for the couple as long as they accept to murder Marsha.','https://image.tmdb.org/t/p/w500/9Py9VvA9MBCgJWH4kOBvDRsdkW5.jpg','1981-03-26',5.6,0),(20564,'The Legend of the Nahuala','es','Leo San Juan, an insecure child of nine years old, lives eternally frightened by horror stories that Nando tells his older brother. Within these stories it is \'The Legend of Nahuala\', according to which, an old abandoned Casona is possessed by the spirit of an evil witch known as the Nahuala.','https://image.tmdb.org/t/p/w500/nQ94eTRXQogJTDwlbq0R8VXSNMZ.jpg','2007-10-31',7.7,0),(20565,'The Pink Panther','en','When the coach of the France soccer team is killed by a poisoned dart in the stadium in the end of a game, and his expensive and huge ring with the diamond Pink Panther disappears, the ambitious Chief Inspector Dreyfus assigns the worst police inspector Jacques Clouseau to the case.','https://image.tmdb.org/t/p/w500/kCP1wi8VyuyboDG0JN7VKlHzPlH.jpg','2006-02-10',5.8,0),(20566,'Friday the 13th Part VII: The New Blood','en','A young girl who possesses the power of telekinesis accidentally causes her father\'s death after a family dispute at Crystal Lake. Years later, when a doctor tries to exploit her abilities, her power becomes a hellish curse, and she unwittingly unchains the merciless, bloodthirsty Jason Voorhees from his watery grave.','https://image.tmdb.org/t/p/w500/xBjEL0k9Cz3QFjnpEK6c8b9Z51o.jpg','1988-05-13',5.4,0),(20567,'The Funeral Home','es','Bernardo is an undertaker. He runs his mortuary business in the same house where he resides. In the front, he has his clients. And in the back, his dysfunctional family lives amongst coffins, wreaths, and the mischievous but nonviolent ghosts that visit on a daily basis. But when a malevolent entity enters the scene, it wreaks havoc on the already fractured household.','https://image.tmdb.org/t/p/w500/1rlgIzw129hEl46bFaJZ7wpEEZZ.jpg','2021-04-15',4.6,0),(20568,'American Gigolo','en','Julian makes a lucrative living as an escort to older women in the Los Angeles area. He begins a relationship with Michelle, a local politician\'s wife, without expecting any pay. One of his clients is murdered and Detective Sunday begins pumping him for details on his different clients, something he is reluctant to do considering the nature of his work. Julian begins to suspect he\'s being framed. Meanwhile Michelle begins to fall in love with him.','https://image.tmdb.org/t/p/w500/igXGCwti23PHOjLKQX6eGIGzQiJ.jpg','1980-02-08',6.1,0),(20569,'A Cinderella Story: Once Upon a Song','en','In this modern telling of the classic tale, aspiring singer Katie Gibbs falls for the new boy at her performing arts high school. But Katie\'s wicked stepmother and stepsister are scheming to crush her dream before she can sing her way into his heart.','https://image.tmdb.org/t/p/w500/awuuwPA8Hy9c5EH04xwkEXOSYiL.jpg','2011-09-05',6.4,0),(20570,'Luther','en','During the early 16th Century idealistic German monk Martin Luther, disgusted by the materialism in the church, begins the dialogue that will lead to the Protestant Reformation.','https://image.tmdb.org/t/p/w500/41bE4D3cbBkmO3cC6c36SthV8ZD.jpg','2003-10-29',6.4,0),(20571,'The Silence','en','With the world under attack by deadly creatures who hunt by sound, a teen and her family seek refuge outside the city and encounter a mysterious cult.','https://image.tmdb.org/t/p/w500/lTVOquzxw2DPF3MKuYd1ynz9F6H.jpg','2019-05-16',6,0),(20572,'The Last of the Mohicans','en','In war-torn colonial America, in the midst of a bloody battle between British, the French and Native American allies, the aristocratic daughter of a British Colonel and her party are captured by a group of Huron warriors. Fortunately, a group of three Mohican trappers comes to their rescue.','https://image.tmdb.org/t/p/w500/fYVQRcgnOv998bKEplzrD3faGgt.jpg','1992-08-26',7.4,0),(20573,'Jungle','en','In 1981, an enthusiastic young adventurer follows his dreams into the Bolivian Amazon jungle with two friends and a guide with a mysterious past. Their journey quickly turns into a terrifying ordeal as the darkest elements of human nature and the deadliest threats of the wilderness lead to an all-out fight for survival.','https://image.tmdb.org/t/p/w500/tDgxknTVwrScxpCYyGUjXSn5NRk.jpg','2017-06-27',6.6,0),(20574,'A Cure for Wellness','en','An ambitious young executive is sent to retrieve his company\'s CEO from an idyllic but mysterious \"wellness center\" at a remote location in the Swiss Alps but soon suspects that the spa\'s miraculous treatments are not what they seem.','https://image.tmdb.org/t/p/w500/d4fXuJS3zZcAZfz2HYDtnwqtnwn.jpg','2017-02-15',6.3,0),(20575,'Eat Pray Love','en','Liz Gilbert had everything a modern woman is supposed to dream of having – a husband, a house and a successful career – yet like so many others, she found herself lost, confused and searching for what she really wanted in life. Newly divorced and at a crossroads, Gilbert steps out of her comfort zone, risking everything to change her life, embarking on a journey around the world that becomes a quest for self-discovery. In her travels, she discovers the true pleasure of nourishment by eating in Italy, the power of prayer in India and, finally and unexpectedly, the inner peace and balance of true love in Bali.','https://image.tmdb.org/t/p/w500/9Hgiv1UEIjc8VwtOmFBCFzMs0er.jpg','2010-08-12',6.2,0),(20576,'Escape from Alcatraz','en','San Francisco Bay, January 18, 1960. Frank Lee Morris is transferred to Alcatraz, a maximum security prison located on a rocky island. Although no one has ever managed to escape from there, Frank and other inmates begin to carefully prepare an escape plan.','https://image.tmdb.org/t/p/w500/uORr2GXQnyqgBOg6tVsRCJD2qxc.jpg','1979-06-22',7.5,0),(20577,'Lake Placid','en','When a man is eaten alive by an unknown creature, the local Game Warden teams up with a paleontologist from New York to find the beast. Add to the mix an eccentric philanthropist with a penchant for \"Crocs\", and here we go! 