ure joins the team of hot-headed superheroes in exchange for a cure for his mother’s deadly illness. The Four from Earth will fight not only to defend the honor of their home planet in the spectacular game, but to face the unprecedented threat to the Galaxy and embrace their own destiny.','https://image.tmdb.org/t/p/w500/eDJYDXRoWoUzxjd52gtz5ODTSU1.jpg','2020-08-27',6.4,0),(20584,'12 Years a Slave','en','In the pre-Civil War United States, Solomon Northup, a free black man from upstate New York, is abducted and sold into slavery. Facing cruelty as well as unexpected kindnesses Solomon struggles not only to stay alive, but to retain his dignity. In the twelfth year of his unforgettable odyssey, Solomon’s chance meeting with a Canadian abolitionist will forever alter his life.','https://image.tmdb.org/t/p/w500/xdANQijuNrJaw1HA61rDccME4Tm.jpg','2013-10-18',8,0),(20585,'American Graffiti','en','A couple of high school graduates spend one final night cruising the strip with their buddies before they go off to college.','https://image.tmdb.org/t/p/w500/1yFdtOV0b9UBUoBNbw0ZcyLbadk.jpg','1973-08-01',7,0),(20586,'Star Trek: The Motion Picture','en','When a destructive space entity is spotted approaching Earth, Admiral Kirk resumes command of the Starship Enterprise in order to intercept, examine, and hopefully stop it.','https://image.tmdb.org/t/p/w500/wfiAfNwH6CMKxz4vRaW8CPTabtk.jpg','1979-12-07',6.5,0),(20587,'The Rental','en','Two couples on an oceanside getaway grow suspicious that the host of their seemingly perfect rental house may be spying on them. Before long, what should have been a celebratory weekend trip turns into something far more sinister.','https://image.tmdb.org/t/p/w500/3ynPnBXQVT2Y0s19fDIPlWKUlxH.jpg','2020-07-23',5.6,0),(20588,'At the Dentist','en','Based on the Buster Brown comic by R.F. Outcault.','https://image.tmdb.org/t/p/w500/dlAeg8zfgEJuNWzhP86jfXr3uq5.jpg','1918-02-25',5,0),(20589,'Born to Race: Fast Track','en','Danny Krueger is a twenty-year old drag racer who plays by his own rules. After winning a scholarship to the prestigious Fast Lane Racing Academy, Danny finds himself competing against some of the fiercest young drivers in the world. Tension soars on and off the track, and a terrible incident leaves Danny without a racing partner. Facing dismissal from the academy, Danny is forced to team up with an old rival. The pair must learn to set aside their differences as they vie for rookie spots on a professional racing team.','https://image.tmdb.org/t/p/w500/sYYQ9kS6Twvt0UcjxGLmBcq5k11.jpg','2014-03-20',6.6,0),(20590,'Midnight in the Switchgrass','en','FBI Agent Karl Helter and his partner Rebecca Lombardo are very close to busting a sex-trafficking ring. When they realize their investigation has crossed the path of a brutal serial killer, they team up with a Texas Ranger to put an end to the infamous \'Truck Stop Killer\'.','https://image.tmdb.org/t/p/w500/1OTSuh2HNcTRfme8caU8DjgJ39K.jpg','2021-07-23',6.1,0),(20591,'Transformers: Dark of the Moon','en','The Autobots continue to work for NEST, now no longer in secret. But after discovering a strange artifact during a mission in Chernobyl, it becomes apparent to Optimus Prime that the United States government has been less than forthright with them.','https://image.tmdb.org/t/p/w500/28YlCLrFhONteYSs9hKjD1Km0Cj.jpg','2011-06-28',6.2,0),(20592,'Prospect','en','A teenage girl and her father travel to a remote alien moon, aiming to strike it rich. They\'ve secured a contract to harvest a large deposit of the elusive gems hidden in the depths of the moon\'s toxic forest. But there are others roving the wilderness and the job quickly devolves into a fight to survive.','https://image.tmdb.org/t/p/w500/1HpAwszXLsD8GeypDzK0me7fPFA.jpg','2018-10-02',6.1,0),(20593,'Supergirl','en','After losing a powerful orb, Kara, Superman\'s cousin, comes to Earth to retrieve it and instead finds herself up against a wicked witch.','https://image.tmdb.org/t/p/w500/6OfuKKCPFclHOj