dy’s lost owner, they discover not only the power of friendship, but their inner superpowers along the way.','https://image.tmdb.org/t/p/w500/aM0Ksnnuc7NtRibMUhXGmAYAMrx.jpg','2019-12-06',7.2,0),(20600,'Young Frankenstein','en','A young neurosurgeon inherits the castle of his grandfather, the famous Dr. Victor von Frankenstein. In the castle he finds a funny hunchback, a pretty lab assistant and the elderly housekeeper. Young Frankenstein believes that the work of his grandfather was delusional, but when he discovers the book where the mad doctor described his reanimation experiment, he suddenly changes his mind.','https://image.tmdb.org/t/p/w500/c6335WJCZO8NK5wehHk5sA9Cypv.jpg','1974-12-15',7.9,0),(20601,'Crouching Tiger, Hidden Dragon: Sword of Destiny','en','A story of lost love, young love, a legendary sword and one last opportunity at redemption.','https://image.tmdb.org/t/p/w500/te3aeAyhkfqgpa5BSTq3oNxGqQD.jpg','2016-02-18',6.1,0),(20602,'Minuscule 2: Mandibles from Far Away','fr','When the first snow falls in the valley, it is urgent to prepare its reserves for the winter. Alas, during the operation, a small ladybug is trapped in a box - to the Caribbean. One solution: reform the shock team.','https://image.tmdb.org/t/p/w500/QVglFM8WHuA5F07IMzFcKu6RXa.jpg','2019-01-30',7.1,0),(20603,'Wrong Place','en','A methamphetamine cook hunts down the former police chief of a small town in order to silence him before he can deliver eyewitness testimony against his family, but ultimately finds himself up against more than he had bargained for.','https://image.tmdb.org/t/p/w500/mlEtOQAQVy6eW65sHz3UduvzRK.jpg','2022-07-15',4.6,0),(20604,'China Dolls','cn','Tong catches Chiu attempting to rape his wife May (Amy Yip). They scuffle and Tong shoots Chiu dead with Chiu\'s gun. They flee but Tong is killed in a shootout with police. May begs an officer to take her child, since if he is repatriated he\'ll have a horrible life. So, the infant son ends up in Hong Kong separated from his mother. Six years pass and May is a hotel maid then gets forced into prostitution. She longs to see her son, who is now a young boy, maybe to fully reunite with him. The problem with this film is it becomes so sleazy. There is nudity (not Ms. Yip), violence and forcible rape.','https://image.tmdb.org/t/p/w500/qsQC9fdhovYI9OC3S2Uys3LDI1U.jpg','1992-01-01',2,0),(20605,'Crimson Tide','en','After the Cold War, a breakaway Russian republic with nuclear warheads becomes a possible worldwide threat. U.S. submarine Capt. Frank Ramsey signs on a relatively green but highly recommended Lt. Cmdr. Ron Hunter to the USS Alabama, which may be the only ship able to stop a possible Armageddon. When Ramsay insists that the Alabama must act aggressively, Hunter, fearing they will start rather than stop a disaster, leads a potential mutiny to stop him.','https://image.tmdb.org/t/p/w500/21nqRJ6ofEgVvEl68J4O9V26Xzy.jpg','1995-05-12',7.2,0),(20606,'The Art of Racing in the Rain','en','A family dog - with a near-human soul and a philosopher\'s mind - evaluates his life through the lessons learned by his human owner, a race-car driver.','https://image.tmdb.org/t/p/w500/mi5VN4ww0JZgRFJIaPxxTGKjUg7.jpg','2019-08-08',8.2,0),(20607,'13 Exorcisms','es','After participating in a séance, young Laura begins to behave strangely. Alarmed, her parents ask Father Olmedo, one of the few exorcists authorized by the Vatican to intervene in cases of demonic possession, for help.','https://image.tmdb.org/t/p/w500/2yzpiUeOQHnbiOayAAwG0FcXRmc.jpg','2022-11-04',4.5,0),(20608,'Letters to Juliet','en','An American girl on vacation in Italy finds an unanswered \"letter to Juliet\" -- one of thousands of missives left at the fictional lover\'s Verona courtyard, which are typically answered by the \"secretaries of Juliet\" -- and she goes on a quest to find the lovers referenced in the letter.','https://image.tmdb.org/t/p/w500/749W0FujsqIupUSHDT3rRTvjHSd.jpg','2010-05-13',7,0),(20609,'The Rite','en','Seminary