xual positions to get Susan back.','https://image.tmdb.org/t/p/w500/ovbMvgOiIsnwx2LSppKqXQxms6z.jpg','1998-11-07',6.3,0),(20783,'The Maid','en','An emotionally troubled teenager gets into a passionate relationship with the older French woman working in his father\'s house.','https://image.tmdb.org/t/p/w500/6qjGX1vJsPBUikaROt1PubDb632.jpg','2014-04-12',4.4,0),(20784,'Moonshot','en','In a future where Mars is terraformed and colonized by the best humanity has to offer, two very different college students wind up joining forces and sneak onboard a space shuttle to the red planet in order to be united with their significant others.','https://image.tmdb.org/t/p/w500/thqgzBPEDYQX0taszVus5nYMtTZ.jpg','2022-05-05',7.2,0),(20785,'Hypnotic','en','A young woman seeking self-improvement enlists the help of a renowned hypnotist but, after a handful of intense sessions, discovers unexpected and deadly consequences.','https://image.tmdb.org/t/p/w500/miEj4kNc4efZ5WbPJqWl1UXWrvS.jpg','2021-10-27',6.1,0),(20786,'A Beautiful Day in the Neighborhood','en','An award-winning cynical journalist, Lloyd Vogel, begrudgingly accepts an assignment to write an Esquire profile piece on the beloved television icon Fred Rogers. After his encounter with Rogers, Vogel\'s perspective on life is transformed.','https://image.tmdb.org/t/p/w500/p9vCAVhDK375XyobVcKqzqzsUHE.jpg','2019-09-07',7,0),(20787,'Girls Trip','en','Four girlfriends take a trip to New Orleans for an annual festival and, along the way, rediscover their wild sides and strengthen the bonds of sisterhood.','https://image.tmdb.org/t/p/w500/fM1h8CwtdileV3zlemXx7UWJjOP.jpg','2017-07-21',6.8,0),(20788,'Playing with Fire','en','A crew of rugged firefighters meet their match when attempting to rescue three rambunctious kids.','https://image.tmdb.org/t/p/w500/nBLPIpReSatt1zcgVzSVzq5e581.jpg','2019-11-08',6.8,0),(20789,'Road to Perdition','en','Mike Sullivan works as a hit man for crime boss John Rooney. Sullivan views Rooney as a father figure,