ian and her bridesmaids just how far you’ll go for someone you love.','https://image.tmdb.org/t/p/w500/gJtA7hYsBMQ7EM3sPBMUdBfU7a0.jpg','2011-05-13',6.5,0),(20811,'Come and See','ru','The invasion of a village in Byelorussia by German forces sends young Florya into the forest to join the weary Resistance fighters, against his family\'s wishes. There he meets a girl, Glasha, who accompanies him back to his village. On returning home, Florya finds his family and fellow peasants massacred. His continued survival amidst the brutal debris of war becomes increasingly nightmarish, a battle between despair and hope.','https://image.tmdb.org/t/p/w500/qNbMsKVzigERgJUbwf8pKyZogpb.jpg','1985-07-09',8.3,0),(20812,'12 Hour Shift','en','It\'s 1999 and over the course of one 12-hour shift at an Arkansas hospital, a junkie nurse, her scheming cousin and a group of black market organ-trading criminals start a heist that could lead to their collective demise.','https://image.tmdb.org/t/p/w500/c3SbZPZPOfGMHq7DB7FnTIMQKuY.jpg','2020-10-02',5.4,0),(20813,'Scooby-Doo! and the Cyber Chase','en','When Scooby and the gang get trapped in a video game created for them, they must fight against the \'Phantom Virus.\' To escape the game they must go level by level and defeat the game once and for all.','https://image.tmdb.org/t/p/w500/mKmFscYvGLMnZ5TslwxCge5oELO.jpg','2001-10-09',7.4,0),(20814,'King Kong','en','In this remake of the 1933 classic, an oil company expedition disturbs the peace of a giant ape and brings him back to New York to exploit him.','https://image.tmdb.org/t/p/w500/paYKhEwUaxKA05vmOfU7FlleTln.jpg','1976-09-08',6.2,0),(20815,'Superman/Batman: Public Enemies','en','United States President Lex Luthor uses the oncoming trajectory of a Kryptonite meteor to frame Superman and declare a $1 billion bounty on the heads of the Man of Steel and his ‘partner in crime’, Batman. Heroes and villains alike launch a relentless pursuit of Superman and Batman, who must unite—and recruit help—to