30',7.2,0),(20840,'Sin City','en','Welcome to Sin City. This town beckons to the tough, the corrupt, the brokenhearted. Some call it dark… Hard-boiled. Then there are those who call it home — Crooked cops, sexy dames, desperate vigilantes. Some are seeking revenge, others lust after redemption, and then there are those hoping for a little of both. A universe of unlikely and reluctant heroes still trying to do the right thing in a city that refuses to care.','https://image.tmdb.org/t/p/w500/i66G50wATMmPrvpP95f0XP6ZdVS.jpg','2005-04-01',7.4,0),(20841,'Atonement','en','As a 13-year-old, fledgling writer Briony Tallis irrevocably changes the course of several lives when she accuses her older sister\'s lover of a crime he did not commit.','https://image.tmdb.org/t/p/w500/hMRIyBjPzxaSXWM06se3OcNjIQa.jpg','2007-09-07',7.7,0),(20842,'Harold & Kumar Go to White Castle','en','Nerdy accountant Harold and his irrepressible friend, Kumar, get stoned watching television and find themselves utterly bewitched by a commercial for White Castle. Convinced there must be one nearby, the two set out on a late-night odyssey that takes them deep into New Jersey. Somehow, the boys manage to run afoul of rednecks, cops and even a car-stealing Neil Patrick Harris before getting anywhere near their beloved sliders.','https://image.tmdb.org/t/p/w500/5vO7R4xYlDipTp8gzfRbWegO8eb.jpg','2004-05-30',6.5,0),(20843,'Twister','en','An unprecedented series of violent tornadoes is sweeping across Oklahoma. Tornado chasers, headed by Dr. Jo Harding, attempt to release a groundbreaking device that will allow them to track them and create a more advanced warning system. They are joined by Jo\'s soon to be ex-husband Bill, a former tornado chaser himself, and his girlfriend Melissa.','https://image.tmdb.org/t/p/w500/6tagtmPVOG4QqraQ4piUFLoqaoj.jpg','1996-05-10',6.5,0),(20844,'Bridget Jones\'s Diary','en','A chaotic Bridget Jones meets a snobbish lawyer, and he soon enters her world of imperfections.','https://image.tmdb.org/t/p/w500/dkauRl9TosBFikftrC3OVcKWDoz.jpg','2001-04-13',6.8,0),(20845,'Jackass Presents: Bad Grandpa','en','86-year-old Irving Zisman is on a journey across America with the most unlikely companion: his 8 year-old grandson, Billy.','https://image.tmdb.org/t/p/w500/dDSMzBEaM0LYSy9Muo0zsCo77Vh.jpg','2013-10-22',6.1,0),(20846,'Extremely Wicked, Shockingly Evil and Vile','en','A chronicle of the crimes of Ted Bundy, from the perspective of his longtime girlfriend, Elizabeth Kloepfer, who refused to believe the truth about him for years.','https://image.tmdb.org/t/p/w500/zSuJ3r5zr5T26tTxyygHhgkUAIM.jpg','2019-05-02',7,0),(20847,'Before I Fall','en','Samantha Kingston has everything. Then, everything changes. After one fateful night, she wakes up with no future at all. Trapped into reliving the same day over and over, she begins to question just how perfect her life really was.','https://image.tmdb.org/t/p/w500/eowzonDJMCuNXoJGVkP9Z7oCmiM.jpg','2017-03-02',7,0),(20848,'Juno','en','Faced with an unplanned pregnancy, an offbeat young woman makes an unusual decision regarding her unborn child.','https://image.tmdb.org/t/p/w500/jNIn2tVhpvFD6P9IojldI3mNYcn.jpg','2007-12-05',7,0),(20849,'The Sex Of The Angels','es','Struggling martial artist and dancer Bruno loves his girlfriend Carla, but when he meets fellow dancer Rai, serious sparks begin to fly, opening the couple up to new possibilities. A new generation navigates sexual fluidity, torn affections, and open relationships in this complicated love triangle.','https://image.tmdb.org/t/p/w500/syUzYJh4GaqoY6lRKBtlnFUqoYa.jpg','2012-05-04',6.6,0),(20850,'Bordertown: The Mural Murders','fi','A mural painted with blood is found on the wall of Pasila train station, which depicts Finland\'s best-known serial killer Lasse Maasalo. The text in the mural, “Making the world a better place”, is linked to a voting circulating in social media, where people can vote for persons that world would be a better place without. Soon the first body is found and Sorjonen must find the person who has named himself as The Judge.','https://image.tmdb.org/t/p/w500/g24OiKp3k9b3VzrhCNcaQzHhZ60.jpg','2021-10-27',6.6,0),(20851,'Cinema Paradiso','it','A filmmaker recalls his childhood, when he fell in love with the movies at his village\'s theater and formed a deep friendship with the theater\'s projectionist.','https://image.tmdb.org/t/p/w500/8SRUfRUi6x4O68n0VCbDNRa6iGL.jpg','1988-11-17',8.5,0),(20852,'Yu-Gi-Oh! The Movie','en','After the conclusion of the Battle City Tournament, deep below the sands of Egypt, an ancient evil has awakened. Anubis, who was defeated centuries ago by Yugi’s mysterious alter ego – the ancient Pharaoh – has returned for revenge. Wielding the power of the Eighth Millennium Item, Anubis is determined to destroy Yugi and take over the world.','https://image.tmdb.org/t/p/w500/3VD5QDTu0rQgRvERBMXtAvg0oIC.jpg','2004-08-13',6.1,0),(20853,'Teen Titans: The Judas Contract','en','Tara Markov is a girl who has power over earth and stone; she is also more than she seems. Is the newest Teen Titan an ally or a threat? And what are the mercenary Deathstroke\'s plans for the Titans?','https://image.tmdb.org/t/p/w500/4MumpGZmbTvHFzxyJ9MtSpqD4FH.jpg','2017-03-31',7.4,0),(20854,'Messi','es','His teachers, coaches, childhood friends and Barça teammates, together with journalists, writers and prominent figures from the history of football, come together in a restaurant to analyze and pick apart Messi\'s personality both on and off the field, and to look back at some of the most significant moments in his life. Viewed from Álex de la Iglesia\'s unique perspective, Messi recreates the player\'s childhood and teenage years, from his very first steps, with a football always at his feet, through to the decision to leave Rosario for Barcelona, the separation from his family, and the role played in his career by individuals such as Ronaldinho, Rijkaard, Rexach and Guardiola.','https://image.tmdb.org/t/p/w500/uROT3bgu8I50EyDA541aozJjYl3.jpg','2014-09-06',7.4,0),(20855,'Unstoppable','en','A runaway train, transporting deadly, toxic chemicals, is barreling down on Stanton, Pennsylvania,  and proves to be unstoppable until a veteran engineer and young conductor risk their lives to try and stop it with a switch engine.','https://image.tmdb.org/t/p/w500/zKvHwL0GqLOear8rTnUPSTRYY0r.jpg','2010-11-04',6.5,0),(20856,'The Girl in the Spider\'s Web','en','After being enlisted to recover a dangerous computer program, hacker Lisbeth Salander and journalist Mikael Blomkvist find themselves caught in a web of spies, cybercriminals and corrupt government officials.','https://image.tmdb.org/t/p/w500/w4ibr8R702DCjwYniry1D1XwQXj.jpg','2018-10-25',6.1,0),(20857,'Trainwreck','en','Having thought that monogamy was never possible, a commitment-phobic career woman may have to face her fears when she meets a good guy.','https://image.tmdb.org/t/p/w500/wrY629UTCUAKLJ4CxQXz6DCE7pr.jpg','2015-07-17',5.8,0),(20858,'The Jungle Book 2','en','Mowgli has been living in the man-village with his little stepbrother Ranjan and his best friend Shanti. But the man-cub still has that jungle rhythm in his heart, and he misses his old buddies Baloo and Bagheera. When Mowgli wanders back to the wild for some swingin\' fun, he soon finds the man-eating tiger Shere Khan is lurking in the shadows and planning his revenge.','https://image.tmdb.org/t/p/w500/DhuskQc9lSjPiYKr9hy0AZ7uiC.jpg','2003-02-07',5.9,0),(20859,'The Goldfinch','en','A boy in New York is taken in by a wealthy family after his mother is killed in a bombing at the Metropolitan Museum of Art. In a rush of panic, he steals \'The Goldfinch\', a painting that eventually draws him into a world of crime.','https://image.tmdb.org/t/p/w500/8NwONmcJmPr0w9A176JorJ3tbJx.jpg','2019-09-12',7.2,0),(20860,'Seven Years in Tibet','en','Austrian mountaineer, Heinrich Harrer journeys to the Himalayas without his family to head an expedition in 1939. But when World War II breaks out, the arrogant Harrer falls into Allied forces\' hands as a prisoner of war. He escapes with a fellow detainee and makes his way to Llaso, Tibet, where he meets the 14-year-old Dalai Lama, whose friendship ultimately transforms his outlook on life.','https://image.tmdb.org/t/p/w500/AwAlbBjAf6K0aX8PPyhTUB1S3X7.jpg','1997-09-12',7.2,0),(20861,'Stigmata','en','A young woman with no strong religious beliefs, Frankie Paige begins having strange and violent experiences, showing signs of the wounds that Jesus received when crucified. When the Vatican gets word of Frankie\'s situation, a high-ranking cardinal requests that the Rev. Andrew Kiernan investigate her case. Soon Kiernan realizes that very sinister forces are at work, and tries to rescue Frankie from the entity that is plaguing her.','https://image.tmdb.org/t/p/w500/8JcIm3ePBQR6scrdidnvdt2HblN.jpg','1999-09-10',6.3,0),(20862,'Playing with Love','it','Laura and Fabrizio have been meeting every summer in the forest by her parent\'s summer home. Fabrizio is a solitary boy with only his dog for company; Laura a sweet but unconfident child. This summer new aspects enter into their story as both are growing up. Laura is falling in love with Fabrizio, while he displays a new sexual awareness of her masked by his malice. Things develop further when they meet Sylvia who, unlike the innocent Laura, is confident and assertive. Fabrizio develops a fascination with her, eventually bribing Laura to fetch her to the forest to join them in play.','https://image.tmdb.org/t/p/w500/f1RFRmPnPdFNcQd1ez0ifiU93u2.jpg','1977-05-17',5.2,0),(20863,'Gangs of New York','en','In 1863, Amsterdam Vallon returns to the Five Points of America to seek vengeance against the psychotic gangland kingpin, Bill the Butcher, who murdered his father years earlier. With an eager pickpocket by his side and a whole new army, Vallon fights his way to seek vengeance on the Butcher and restore peace in the area.','https://image.tmdb.org/t/p/w500/lemqKtcCuAano5aqrzxYiKC8kkn.jpg','2002-12-14',7.3,0),(20864,'Lion','en','A five-year-old Indian boy gets lost on the streets of Calcutta, thousands of kilometers from home. He survives many challenges before being adopted by a couple in Australia; 25 years later, he sets out to find his lost family.','https://image.tmdb.org/t/p/w500/iBGRbLvg6kVc7wbS8wDdVHq6otm.jpg','2016-11-24',8.1,0),(20865,'Erax','en','Monstrous creatures leap from a magical storybook and unleash mayhem and mischief for Auntie Opal and her tween niece Nina in this spooky short film.','https://image.tmdb.org/t/p/w500/rMp04rYhy4yfOfjZq5F9R3wkeqo.jpg','2022-02-17',4.7,0),(20866,'Confessions of an Invisible Girl','pt','When the clever but socially-awkward Tetê joins a new school, she\'ll do anything to fit in. But the queen bee among her classmates has other ideas.','https://image.tmdb.org/t/p/w500/fRxz9cKaCOF5noUBvoA6cebOdUE.jpg','2021-09-22',6.9,0),(20867,'Planet 51','en','When Earth astronaut Capt. Chuck Baker arrives on Planet 51 -- a world reminiscent of American suburbia circa 1950 -- he tries to avoid capture, recover his spaceship and make it home safely, all with the help of an empathetic little green being.','https://image.tmdb.org/t/p/w500/x7Itcg3ZdExKwdKguy73WPEqosW.jpg','2009-11-19',5.8,0),(20868,'Upside Down','en','In an alternate universe where twinned worlds have opposite gravities, a young man battles interplanetary prejudice and the laws of physics in his quest to reunite with the long-lost girl of his dreams in this visually stunning romantic adventure that poses the question: what if love was stronger than gravity?','https://image.tmdb.org/t/p/w500/9hKKjXqrTW73Ob4wPJooNuhVpBg.jpg','2012-09-27',6.2,0),(20869,'Giant Spider','zh','In a mysterious laboratory located in the desert, the experimental spiders used for genetic research mutate and turn into giant spider monsters, turning the laboratory into a giant spider\'s lair. A few days later, a special warfare team led by the captain Gao Qiang, escorting Dr. Chen, a scientist of the Kwon Plant Group, goes to the laboratory to rescue the trapped people and try to retrieve the relevant scientific research data','https://image.tmdb.org/t/p/w500/5ApvzOzDQHMvrp59tOiCF2yLh7d.jpg','2021-05-30',7.2,0),(20870,'V/H/S/94','en','A mysterious VHS tape leads a police S.W.A.T. team to the discovery of a sinister cult whose collection of pre-recorded material reveals a nightmarish conspiracy.','https://image.tmdb.org/t/p/w500/9fSogEkqDfJQTuGHsTFloQz3Tw8.jpg','2021-09-26',6.2,0),(20871,'Not Without My Daughter','en','An American woman, trapped in Islamic Iran by her brutish husband, must find a way to escape with her daughter as well.','https://image.tmdb.org/t/p/w500/9EwpERBZ6urOSUokGqiLq8hYRxC.jpg','1991-01-11',6.6,0),(20872,'In the Arms of an Assassin','es','Victor (William Levy) is one of the world’s most handsome  men, but he has a deep secret – he is a cold blooded assassin. Smooth talking and seductive, Victor was raised to do one thing only, which is to kill for money. When he is sent to the home of a brutal drug lord to collect payment for his most recent hit, he encounters the beautiful Sarai (Alicia Sanz), who has been forced to spend the last 9 years of her life with the drug lord.','https://image.tmdb.org/t/p/w500/iqRUOtbDunNq7gTux3zXz25Krwp.jpg','2019-12-06',8.1,0),(20873,'Run All Night','en','Brooklyn mobster and prolific hit man Jimmy Conlon has seen better days. Longtime best friend of a mob boss, Jimmy is haunted by the sins of his past—as well as a dogged police detective who’s been one step behind Jimmy for 30 years. But when Jimmy’s estranged son becomes a target, Jimmy must make a choice between the crime family he chose and the real family he abandoned long ago. Now, with nowhere safe to turn, Jimmy has just one night to figure out exactly where his loyalties lie and to see if he can finally make things right.','https://image.tmdb.org/t/p/w500/frzdzHceByAIlwVKvSvY9zqpjyV.jpg','2015-03-11',6.4,0),(20874,'End of Days','en','On 28 December 1999, the citizens of New York City are getting ready for the turn of the millennium. However, Satan decides to crash the party by coming to the city  and searching for his chosen bride — a 20-year-old woman named Christine York. The world will end, and the only hope lies within an atheist named Jericho Cane.','https://image.tmdb.org/t/p/w500/pY8FbKKl3VD0jRI1iDFrwN6alLa.jpg','1999-11-24',6,0),(20875,'Fatman','en','A rowdy, unorthodox Santa Claus is fighting to save his declining business. Meanwhile, Billy, a neglected and precocious 12 year old, hires a hit man to kill Santa after receiving a lump of coal in his stocking.','https://image.tmdb.org/t/p/w500/4n8QNNdk4BOX9Dslfbz5Dy6j1HK.jpg','2020-10-19',5.5,0),(20876,'The Man from U.N.C.L.E.','en','At the height of the Cold War, a mysterious criminal organization plans to use nuclear weapons and technology to upset the fragile balance of power between the United States and Soviet Union. CIA agent Napoleon Solo and KGB agent Illya Kuryakin are forced to put aside their hostilities and work together to stop the evildoers in their tracks. The duo\'s only lead is the daughter of a missing German scientist, whom they must find soon to prevent a global catastrophe.','https://image.tmdb.org/t/p/w500/zkacOORjKJxRswDurffyvkMwriS.jpg','2015-08-13',7.1,0),(20877,'Moneyball','en','The story of Oakland Athletics general manager Billy Beane\'s successful attempt to put together a baseball team on a budget, by employing computer-generated analysis to draft his players.','https://image.tmdb.org/t/p/w500/4yIQq1e6iOcaZ5rLDG3lZBP3j7a.jpg','2011-09-23',7.2,0),(20878,'Fidelity','ru','Lena is a talented midwife and gynaecologist, her husband Serezha is an actor at a provincial drama theatre. They are close and gentle with each other, but there is no sex. Lena suspects that Serezha has an affair, but she worries quietly and does not reveal her jealousy. Instead of sorting out her relationship with her husband, Lena starts to betray him with chance acquaintances. Gradually Lena’s parallel life gets out of control and changes her original life.','https://image.tmdb.org/t/p/w500/kDaRVADrrbwNSGzCvU4AroEa6h1.jpg','2019-10-31',6.9,0),(20879,'Diamonds Are Forever','en','Diamonds are stolen only to be sold again in the international market. James Bond infiltrates a smuggling mission to find out who\'s guilty. The mission takes him to Las Vegas where Bond meets his archenemy Blofeld.','https://image.tmdb.org/t/p/w500/tOrCHtj4uUOt5p57F3SUwWbsQiE.jpg','1971-12-13',6.4,0),(20880,'Kung-Fu Zohra','fr','Zohra is convinced that separating from her husband Omar would break her little girl’s heart and so determines not to leave him despite the violence he metes out. Then she meets Chang Sue, the caretaker of the gym where she works to make ends meet. When she learns that he’s a kung fu master, Zohra asks him to teach her some self-defence basics…','https://image.tmdb.org/t/p/w500/uHTgTqZCQN5kd22QlyZMpPcFU3s.jpg','2022-03-09',5.6,0),(20881,'Under Siege','en','Disgruntled ex-CIA operative Strannix, his assistant Krill and their group of terrorists seize the battleship with nuclear blackmail in mind. They\'ve planned for every contingency but ignore the ship\'s cook, former Navy SEAL Casey Ryback -- an error that could be fatal.','https://image.tmdb.org/t/p/w500/myHxm9p8fhEsXyaLO6DawYJKolg.jpg','1992-10-08',6.3,0),(20882,'The Devil All the Time','en','In Knockemstiff, Ohio and its neighboring backwoods, sinister characters converge around young Arvin Russell as he fights the evil forces that threaten him and his family.','https://image.tmdb.org/t/p/w500/bVL7LGq528h3KzeNI90HOVbV5uW.jpg','2020-09-11',7.2,0),(20883,'Saw','en','David, an orderly at a hospital, tells his horrific story of being kidnapped and forced to play a vile game of survival.','https://image.tmdb.org/t/p/w500/qQ3oSIJhHxdLyOimhO8HKCovajX.jpg','2003-01-01',7,0),(20884,'Cannibal Ferox','it','Three friends 