f homicidal gangsters get T, Downs’ teenage son. In one sleepless night, he will have to rescue his son T (whom they got), evade an internal affairs investigation and bring the kidnappers to justice.','https://image.tmdb.org/t/p/w500/9WkUSY33MDPGmz0vtzbsfaxTHVa.jpg','2017-01-12',5.9,0),(20901,'Knocked Up','en','A slacker and a career-driven woman accidentally conceive a child after a one-night stand. As they try to make the relationship work, they must navigate the challenges of parenthood and their differences in lifestyle and maturity.','https://image.tmdb.org/t/p/w500/b4OaXw2MW97VvIiZE0Sbn1NfxSh.jpg','2007-06-01',6.3,0),(20902,'The Substitute','en','When an inner-city Miami schoolteacher gets her knee broken after standing up to the school\'s gang leader, her mercenary combat specialist boyfriend goes undercover as a substitute teacher to take down the punk. Soon he discovers a conspiracy of criminals at work, and must reassemble his team from his last jungle raid to stop them.','https://image.tmdb.org/t/p/w500/jlhe2SKWqW3F7BEQl3sOkgXLtkW.jpg','1996-04-19',6.8,0),(20903,'Fantasy Island','en','A group of contest winners arrive at an island hotel to live out their dreams, only to find themselves trapped in nightmare scenarios.','https://image.tmdb.org/t/p/w500/8ZMrZGGW65ePWIgRn1260nA1uUm.jpg','2020-02-12',5.9,0),(20904,'Red Riding Hood','en','Valerie is in love with a brooding outsider, Peter, but her parents have arranged for her to marry another man – who is wealthy. Unwilling to lose each other, Valerie and Peter plan to run away together when they learn that Valerie\'s older sister has been killed by a werewolf that prowls the dark forest surrounding their village. Hungry for revenge, the people call on famed werewolf hunter, Father Solomon, to help them kill the wolf. But Solomon\'s arrival brings unintended consequences as he warns that the wolf, who takes human form by day, could be any one of them.','https://image.tmdb.org/t/p/w500/ixQYkLeLlTTnAoT32dukndyObB6.jpg','2011-03-11',6,0),(20905,'Chloe','en','A doctor hires an escort to seduce her husband, whom she suspects of cheating, though unforeseen events put the family in danger.','https://image.tmdb.org/t/p/w500/7VC7Q7GvIhEECIU3fiaRf71mxV6.jpg','2010-03-04',6.1,0),(20906,'Vicky and Her Mystery','fr','Stéphane decides to move to the beautiful mountains of Cantal in order to reconnect with his 8-year-old daughter, Victoria, who has been silent since her mother\'s disappearance. During a walk in the forest, a shepherd gives Victoria a puppy named \"Mystery\" who will gradually give her a taste for life. But very quickly, Stéphane discovers that the animal is in reality a wolf… Despite the warnings and the danger of this situation, he cannot bring himself to separate his daughter from this seemingly harmless ball of hair.','https://image.tmdb.org/t/p/w500/u6fBXfWU7jaG0zWYiOvh1myEQC.jpg','2021-12-15',7.2,0),(20907,'Mighty Morphin Power Rangers: The Movie','en','Six incredible teens out-maneuver and defeat evil everywhere as the Mighty Morphin Power Rangers, but this time the Power Rangers may have met their match when they face off with Ivan Ooze, the most sinister monster the galaxy has ever seen.','https://image.tmdb.org/t/p/w500/h18blchYYeoAfQHsEMGYUNbht0C.jpg','1995-06-30',5.8,0),(20908,'The Monuments Men','en','Based on the true story of the greatest treasure hunt in history, The Monuments Men is an action drama focusing on seven over-the-hill, out-of-shape museum directors, artists, architects, curators, and art historians who went to the front lines of WWII to rescue the world’s artistic masterpieces from Nazi thieves and return them to their rightful owners.  With the art hidden behind enemy lines, how could these guys hope to succeed?','https://image.tmdb.org/t/p/w500/wiWAg4mKV2S4vImPxsPRIdj2R2B.jpg','2014-01-24',6,0),(20909,'Shanghai Fortress','zh','Set in the future, the city of Shanghai battle to defend itself against an ongoing attack by an alien force that has attacked and laid siege to numerous cities around the globe in it\'s quest to harvest a hidden energy only found on earth.','https://image.tmdb.org/t/p/w500/cODqUZ3XzDz4lkhxw0OnaUSfz8R.jpg','2019-08-09',5.6,0),(20910,'Moms\' Night Out','en','Yearning for an evening without their kids, some friends plan a night out. But to do this, their husbands need to watch the kids. What can go wrong?','https://image.tmdb.org/t/p/w500/gP97yU8YrVZY2yLxTwsicS8KuSe.jpg','2014-03-25',5.6,0),(20911,'Bright','en','In an alternate present-day where magical creatures live among us, two L.A. cops become embroiled in a prophesied turf battle.','https://image.tmdb.org/t/p/w500/whkT53Sv2vKAUiknQ13pqcWaPXB.jpg','2017-12-22',6.2,0),(20912,'Star Trek IV: The Voyage Home','en','It\'s the 23rd century, and a mysterious alien power is threatening Earth by evaporating the oceans and destroying the atmosphere. In a frantic attempt to save mankind, Kirk and his crew must time travel back to 1986 San Francisco where they find a world of punk, pizza and exact-change buses that are as alien as anything they\'ve ever encountered in the far reaches of the galaxy. A thrilling, action-packed Star Trek adventure!','https://image.tmdb.org/t/p/w500/xY5TzGXJOB3L9rhZ1MbbPyVlW5J.jpg','1986-11-26',7.2,0),(20913,'Suspiria','en','Young American dancer Susie Bannion arrives in 1970s Berlin to audition for the world-renowned Helena Markos Dance Company. When she vaults to the role of lead dancer, the woman she replaces breaks down and accuses the company\'s female directors of witchcraft. Meanwhile, an inquisitive psychotherapist and a member of the troupe uncover dark and sinister secrets as they probe the depths of the studio\'s hidden underground chambers.','https://image.tmdb.org/t/p/w500/dzWTnkert9EoiPWldWJ15dnfAFl.jpg','2018-10-11',6.9,0),(20914,'The Queen\'s Corgi','en','Since his arrival at Buckingham palace, Rex lives a life of luxury. Top dog, he has superseded his three fellow Corgis in Her Majesty’s heart. His arrogance can be quite irritating. When he causes a diplomatic incident during an official dinner with the President of the United States, he falls into disgrace. Betrayed by one of his peers, Rex becomes a stray dog in the streets of London. How can he redeem himself? In love, he will find the resources to surpass himself in the face of great danger…','https://image.tmdb.org/t/p/w500/xcl4vYTqqzwn3ihUpjCQz0jqhV3.jpg','2019-02-13',6,0),(20915,'The Star','en','A small but brave donkey and his animal friends become the unsung heroes of the greatest story ever told, the first Christmas.','https://image.tmdb.org/t/p/w500/tEbDvivUfsCupngKIfMJJ725eAD.jpg','2017-11-15',6.2,0),(20916,'Logan Lucky','en','Trying to reverse a family curse, brothers Jimmy and Clyde Logan set out to execute an elaborate robbery during the legendary Coca-Cola 600 race at the Charlotte Motor Speedway.','https://image.tmdb.org/t/p/w500/mQrhrBaaHvRfBQq0Px3HtVbH9iE.jpg','2017-08-17',6.7,0),(20917,'The Reader','en','The story of Michael Berg, a German lawyer who, as a teenager in the late 1950s, had an affair with an older woman, Hanna, who then disappeared only to resurface years later as one of the defendants in a war crimes trial stemming from her actions as a concentration camp guard late in the war. He alone realizes that Hanna is illiterate and may be concealing that fact at the expense of her freedom.','https://image.tmdb.org/t/p/w500/r0WURbmnhgKeBpHcpDULBgRedQM.jpg','2008-01-02',7.4,0),(20918,'Through My Window: Across the Sea','es','Sequel to \'Through My Window\'.','https://image.tmdb.org/t/p/w500/5eVMtvzjouUNtqIvAsPY4ly4xzE.jpg','0000-00-00',0,0),(20919,'Do You Believe?','en','When a pastor is shaken by the visible faith of a street-corner preacher, he is reminded that true belief always requires action. His response ignites a journey that impacts everyone it touches in ways that only God could orchestrate.','https://image.tmdb.org/t/p/w500/89fJ4hV9fCB01EvhhLOgjMJI4A6.jpg','2015-03-20',6.6,0),(20920,'Dragonheart 3: The Sorcerer\'s Curse','en','When aspiring knight Gareth goes in search of a fallen comet rumored to contain gold, he is shocked to instead find the dragon Drago. After Drago saves Gareth\'s life the two become intricately bonded, and must work together to defeat an evil sorcerer and stop his reign of terror. Along the way, Gareth learns the true meaning of being a knight in this fantasy action-adventure for the ages.','https://image.tmdb.org/t/p/w500/mN6B5ITOFelW7OhR7tGd51VhXmH.jpg','2015-02-24',5.4,0),(20921,'The Sky Is Everywhere','en','Lennie is a teen musical prodigy grieving the death of her sister when she finds herself caught between a new guy at school and her sister\'s devastated boyfriend. Through her vivid imagination and conflicted heart, Lennie navigates first love and first loss.','https://image.tmdb.org/t/p/w500/qMVUlq6rdqFo1xZ5ozQcKFCDbgj.jpg','2022-02-11',5.6,0),(20922,'Clash of the Titans','en','To win the right to marry his love, the beautiful princess Andromeda, and fulfil his destiny, half-God-half-mortal Perseus must complete various tasks including taming Pegasus, capturing Medusa\'s head and battling the feared Kraken.','https://image.tmdb.org/t/p/w500/5JCLODNLJH6alc3KmyoiC21Nlob.jpg','1981-06-12',6.9,0),(20923,'Happiest Season','en','A young woman\'s plans to propose to her girlfriend while at her family\'s annual holiday party are upended when she discovers her partner hasn\'t yet come out to her conservative parents.','https://image.tmdb.org/t/p/w500/vzec9kkOSE93tygyfOktedkeOQ.jpg','2020-11-26',7.4,0),(20924,'The World Is Not Enough','en','Greed, revenge, world dominance and high-tech terrorism – it\'s all in a day\'s work for Bond, who\'s on a mission to protect a beautiful oil heiress from a notorious terrorist. In a race against time that culminates in a dramatic submarine showdown, Bond works to defuse the international power struggle that has the world\'s oil supply hanging in the balance.','https://i