r, Stacie and Chelsea, and their adorable new puppy friends find unexpected mystery and adventure when they return to their hometown of Willows. While going through mementos in Grandma\'s attic, the sisters discover an old map, believed to lead to a long-lost treasure buried somewhere in the town. With their puppy pals in tow, the four girls go on an exciting treasure hunt, along the way discovering that the greatest treasure of all is the love and laughter they share as sisters!','https://image.tmdb.org/t/p/w500/3ybjPWweUjPXXqIXFERgPnOQ5O3.jpg','2015-10-07',7.3,0),(20931,'Occupation: Rainfall','en','Two years into an intergalactic invasion of Earth, survivors in Sydney, Australia, fight back in a desperate ground war. As casualties mount by the day, the resistance and their unexpected allies, uncover a plot that could see the war come to a decisive end. With the Alien invaders hell-bent on making earth their new home, the race is on to save mankind.','https://image.tmdb.org/t/p/w500/vpq8XjZ3ZalcbqWOYIdqcV7FbIJ.jpg','2021-10-15',6.3,0),(20932,'Primal','en','A big-game hunter for zoos books passage on a Greek shipping freighter with a fresh haul of exotic and deadly animals from the Amazon, including a rare white Jaguar – along with a political assassin being extradited to the U.S in secret. Two days into the journey, the assassin escapes and releases the captive animals, throwing the ship into chaos.','https://image.tmdb.org/t/p/w500/v0Air5GTsfgtjsnZyji2lH6r2b8.jpg','2019-12-27',5.7,0),(20933,'Mi Prima La Sexóloga','es','A young man is afraid of asking for sex tips to his cousin, the sexologist.','https://image.tmdb.org/t/p/w500/uWK3hKEHq0lfsKjgp07nQHuDqpO.jpg','2016-07-21',7,0),(20934,'Son of Batman','en','Batman learns he has a violent, unruly pre-teen son, secretly raised by the terrorist group known as The League of Assassins.','https://image.tmdb.org/t/p/w500/yHx8OLSKc3VtIBB5lIe90c0fHOX.jpg','2014-05-13',7,0),(20935,'Fist of Fury','zh','Chen Chen returns to his