ship begins to get complicated.','https://image.tmdb.org/t/p/w500/vnTCgupgTMZSGbl1InrO2UhTz9S.jpg','1986-02-09',6.1,0),(20990,'Freedom Writers','en','A young teacher inspires her class of at-risk students to learn tolerance, apply themselves, and pursue education beyond high school.','https://image.tmdb.org/t/p/w500/81AdeUQT99N0xPg3j6RVh0YGOTk.jpg','2007-01-05',7.9,0),(20991,'Ninja: Shadow of a Tear','en','Fight everyone and trust no one: it\'s the code of survival practiced by martial-arts master Casey Bowman after his life of domestic bliss is shattered by a savage act of violence. Vowing revenge, the fearless American stealthily tracks the killer from Osaka to Bangkok to Rangoon with the help of a wise and crafty sensei. His only clues: a series of victims whose necks bear the distinctive mark of strangulation by barbed wire. Fighting to avenge as well as to survive, Casey must sharpen his razor-like responses and take his battle skills to the next level, even using deep meditation to fake his own death. His target: the sinister drug lord Goro, who is flooding the streets with deadly meth cooked at his remote jungle factory. To prepare for his ultimate confrontation, Casey must finally become an invisible warrior worthy of the name Ninja. But just when his prey is cornered, an unexpected twist shows Casey that his battle is only beginning: he truly can trust no one.','https://image.tmdb.org/t/p/w500/7NlwlXXmq3D4UZmcsQj58hcAf6m.jpg','2013-12-27',6.6,0),(20992,'Fist of Legend','zh','Chen Zhen, a Chinese engineering student in Kyoto, who braves the insults and abuse of his Japanse fellow students for his local love Mitsuko Yamada, daughter of the director, returns in 1937 to his native Shangai, under Japanse protectorate -in fact military occupation- after reading about the death of his kung-fu master Hou Ting-An in a fight against the Japanese champion Ryuichi Akutagawa.','https://image.tmdb.org/t/p/w500/Aqa1Yuog2OFrduwSffxZc2w4Tnk.jpg','1994-12-22',7.5,0),(20993,'