spital. They search for evidence of paranormal activity as they shoot what ends up becoming their final episode.','https://image.tmdb.org/t/p/w500/8vnsB3Rg9Gb91UOaecXRb7dYB37.jpg','2011-09-09',6.3,0),(20999,'Sleeping Beauty','en','A haunting erotic fairytale about Lucy, a young University student drawn into a mysterious hidden world of beauty and desire.','https://image.tmdb.org/t/p/w500/l1Lx8iRsml1JnPBY0qgn6IN5FQg.jpg','2011-06-10',5.4,0),(21000,'The Colony','en','In the not-too-distant future: after a global catastrophe has wiped out nearly all of humanity on Earth, an elite astronaut from Space Colony Kepler must make a decision that will seal the fate of the people on both planets.','https://image.tmdb.org/t/p/w500/nX7ZUYwgGOCe5nXXwpNg4hAf1xB.jpg','2021-08-26',5.7,0),(21001,'Star Wars: The Clone Wars','en','Set between Episode II and III, The Clone Wars is the first computer animated Star Wars film. Anakin and Obi Wan must find out who kidnapped Jabba the Hutt\'s son and return him safely. The Separatists will try anything to stop them and ruin any chance of a diplomatic agreement between the Hutts and the Republic.','https://image.tmdb.org/t/p/w500/d6YOfi0T9GowglzIkDQGGvGYVTM.jpg','2008-08-05',6.1,0),(21002,'Good Luck Chuck','en','Cursed since childhood, dentist Charlie Logan cannot find the right woman. Even worse, he learns that each of his ex-girlfriends finds true love with the man she meets after her relationship with him ends. Hearing of Charlie\'s reputation as a good-luck charm, women from all over line up for a quick tryst. But when Charlie meets the woman of his dreams, he must find a way to break the curse or risk losing her to the next man she meets.','https://image.tmdb.org/t/p/w500/eGxaRbDfxBWPysoxkOfYgkwflxJ.jpg','2007-09-21',5.9,0),(21003,'The Apartment','en','Bud Baxter is a minor clerk in a huge New York insurance company, until he discovers a quick way to climb the corporate ladder. He lends out his apartment to the executives as a place to take their mistresses. Although he often has to deal with the aftermath of their visits, one night he\'s left with a major problem to solve.','https://image.tmdb.org/t/p/w500/hhSRt1KKfRT0yEhEtRW3qp31JFU.jpg','1960-06-21',8.2,0),(21004,'Spenser Confidential','en','Spenser, a former Boston patrolman who just got out from prison, teams up with Hawk, an aspiring fighter, to unravel the truth behind the death of two police officers.','https://image.tmdb.org/t/p/w500/fePczipv6ZzDO2uoww4vTAu2Sq3.jpg','2020-03-06',6.5,0),(21005,'Babe','en','Babe is a little pig who doesn\'t quite know his place in the world. With a bunch of odd friends, like Ferdinand the duck who thinks he is a rooster and Fly the dog he calls mum, Babe realises that he has the makings to become the greatest sheep pig of all time, and Farmer Hogget knows it. With the help of the sheep dogs, Babe learns that a pig can be anything that he wants to be.','https://image.tmdb.org/t/p/w500/zKuQMtnbVTz9DsOnOJmlW71v4qH.jpg','1995-07-18',6.2,0),(21006,'Minnal Murali','ml','A tailor gains special powers after being struck by lightning but must take down an unexpected foe if he is to become the superhero his hometown in Kerala needs.','https://image.tmdb.org/t/p/w500/5jHnykugFB3awLTwDM5LQ93TIzs.jpg','2021-12-16',7.2,0),(21007,'Alice','en','Alice spends her days enslaved on a rural Georgia plantation restlessly yearning for freedom. After a violent clash with plantation owner Paul, Alice flees through the neighboring woods and stumbles onto the unfamiliar sight of a highway, soon discovering the year is actually 1973.','https://image.tmdb.org/t/p/w500/jrGyjoCsRLVbzmsaeFCueOnGOKL.jpg','2022-03-18',5.6,0),(21008,'Starship Troopers: Invasion','en','A distant Federation outpost Fort Casey comes under attack by bugs. The team on the fast attack ship Alesia is assigned to help the Starship John A. Warden stationed in Fort Casey evacuate along with the survivors and bring military intelligence safely back to Earth. Carl Jenkins, now ministry of Paranormal Warfare, takes the starship on a clandestine mission before its rendezvous with the Alesia and goes missing in the nebula. Now, the battle-hardened troopers are charged with a rescue mission that may lead to a much more sinister consequence than they ever could have imagined....','https://image.tmdb.org/t/p/w500/xJJY16XSazUgDvbWEXQ1ulLiz8q.jpg','2012-07-21',5.9,0),(21009,'Romancing the Stone','en','Though she can spin wild tales of passionate romance, novelist Joan Wilder has no life of her own. Then one day adventure comes her way in the form of a mysterious package. It turns out that the parcel is the ransom she\'ll need to free her abducted sister, so Joan flies to South America to hand it over. But she gets on the wrong bus and winds up hopelessly stranded in the jungle.','https://image.tmdb.org/t/p/w500/qfIlVOYZH5RiZ0ndFKUpr5Zn2Bx.jpg','1984-03-30',6.7,0),(21010,'Black as Night','en','A teenage girl with self-esteem issues finds confidence in the most unlikely way, by spending her summer battling vampires that prey on New Orleans\' disenfranchised with the help of her best friend, the boy she\'s always pined for, and a peculiar rich girl.','https://image.tmdb.org/t/p/w500/mx6cgtUiEOVGSI3sb3SNQxAXqRa.jpg','2021-10-01',5.6,0),(21011,'Rio Bravo','en','The sheriff of a small town in southwest Texas must keep custody of a murderer whose brother, a powerful rancher, is trying to help him escape. After a friend is killed trying to muster support for him, he and his deputies must find a way to hold out against the rancher\'s hired guns until the marshal arrives. In the meantime, matters are complicated by the presence of a young gunslinger - and a mysterious beauty who just came in on the last stagecoach.','https://image.tmdb.org/t/p/w500/4gI4KKmoi0d3yfsF71YU3S0I5t8.jpg','1959-03-17',7.9,0),(21012,'Riley\'s First Date?','en','Riley, now 12, who is hanging out with her parents at home when potential trouble comes knocking. Mom\'s and Dad\'s Emotions find themselves forced to deal with Riley going on her first \"date.\"','https://image.tmdb.org/t/p/w500/cGLwfmLqg39822RFQMUDat0UJev.jpg','2015-11-03',7.2,0),(21013,'Four Weddings and a Funeral','en','Over the course of five social occasions, a committed bachelor must consider the notion that he may have discovered love.','https://image.tmdb.org/t/p/w500/qa72G2VS0bpxms6yo0tI9vsHm2e.jpg','1994-03-09',6.8,0),(21014,'Queenpins','en','Bored and frustrated suburban homemaker Connie and her best pal JoJo, a vlogger with dreams, turn a hobby into a multi-million-dollar counterfeit coupon caper. After firing off a letter to the conglomerate behind a box of cereal gone stale, and receiving an apology along with dozens of freebies, the duo hatch an illegal coupon club scheme that scams millions from mega-corporations and delivers deals to legions of fellow coupon clippers. On the trail to total coupon dominance, a hapless Loss Prevention Officer from the local supermarket chain joins forces with a determined U.S. Postal Inspector in hot pursuit of these newly minted “Queenpins” of pink collar crime.','https://image.tmdb.org/t/p/w500/p5Uz76EOwj9rAsdGxYL8IZGPV2B.jpg','2021-08-26',6.4,0),(21015,'[REC]²','es','The action continues from [REC], with the medical officer and a SWAT team outfitted with video cameras are sent into the sealed off apartment to control the situation.','https://image.tmdb.org/t/p/w500/gWmIqmhb6B6bmL6EPX4sVx0jO02.jpg','2009-09-15',6.6,0),(21016,'Untold: The Race of the Century','en','The Australia II yacht crew looks back on the motivation, dedication and innovation that led to their historic victory at the 1983 America\'s Cup.','https://image.tmdb.org/t/p/w500/49IMDELdD1LakVrnfVAi4qSfq4I.jpg','2022-09-06',7.3,0),(21017,'Three Colors: Blue','fr','Julie is haunted by her grief after living through a tragic auto wreck that claimed the life of her composer husband and young daughter. Her initial reaction is to withdraw from her relationships, lock herself in her apartment and suppress her pain. But avoiding human interactions on the bustling streets of Paris proves impossible, and she eventually meets up with Olivier, an old friend who harbors a secret love for her, and who could draw her back to reality.','https://image.tmdb.org/t/p/w500/33wsWxzsNstI8N7dvuwzFmj1qBd.jpg','1993-08-01',7.7,0),(21018,'Germany, Year Zero','it','In the ruins of post-WWII Berlin, a twelve-year-old boy is left to his own devices in order to help provide for his family.','https://image.tmdb.org/t/p/w500/sdxegsjrrvujXvv2GLPENyDlWDI.jpg','1948-12-01',7.7,0),(21019,'Reminiscence','en','Nicolas Bannister, a rugged and solitary veteran living in a near-future Miami flooded by rising seas, is an expert in a dangerous occupation: he offers clients the chance to relive any memory they desire. His life changes when he meets a mysterious young woman named Mae. What begins as a simple matter of lost and found becomes a passionate love affair. But when a different client\'s memories implicate Mae in a series of violent crimes, Bannister must delve through the dark world of the past to uncover the truth about the woman he fell for.','https://image.tmdb.org/t/p/w500/17siH6wJRQ2jZiqz9BWUhy1UtZ.jpg','2021-08-19',6.8,0),(21020,'The Princess Switch','en','When a down-to-earth Chicago baker and a soon-to-be princess discover they look like twins, they hatch a Christmastime plan to trade places.','https://image.tmdb.org/t/p/w500/A8XgZE8CsHiYN243MEd07GLCep.jpg','2018-11-16',7,0),(21021,'Catwoman','en','A shy woman, endowed with the speed, reflexes, and senses of a cat, walks a thin line between criminal and hero, even as a detective doggedly pursues her, fascinated by both of her personas','https://image.tmdb.org/t/p/w500/pvnPgukFyEKgCzyOxyLiwyZ8T1C.jpg','2004-07-22',4.6,0),(21022,'Daddy Day Care','en','Two men get laid off and have to become stay-at-home dads when they can\'t find jobs, which inspires them to open their own day-care center.','https://imag