 the Little Rascals are unable to raise enough money to save their grandma\'s bakery from shutting down, their only hope is to win a local talent show and use the prize money to save the shop.','https://image.tmdb.org/t/p/w500/6nuZUJge3egVZI1rPLVpjRHPMf7.jpg','2014-03-25',6.1,0),(21029,'Fear','en','Nicole Walker always dreamed of being swept away by someone special — someone strong, sexy and sensitive who would care for her more than anything else in the world. David is all that and more: a modern-day knight who charms and seduces her, body and soul. But her perfect boyfriend is not all he seems to be. His sweet facade masks a savage, dark side that will soon transform Nicole\'s dream into a nightmare.','https://image.tmdb.org/t/p/w500/yYpvf7WdCCImNrFpVMEwFL1XZE4.jpg','1996-04-12',6.4,0),(21030,'Tremors: Shrieker Island','en','Graboids are illegally taken to a new island resort by a rich playboy as a dangerous form of trophy hunting, and Burt Gummer steps up to save the day.','https://image.tmdb.org/t/p/w500/46qwaON7l11M407rqh8lD4vXcAR.jpg','2020-10-20',6.2,0),(21031,'Arthur 3: The War of the Two Worlds','en','Maltazard, the Evil M, is now 7 feet tall and evolving among the humans, causing terror wherever he goes. His goal is simple: forming an army of giant henchmen and ruling over the universe. Meanwhile, Arthur is still a Minimoy, and thus in a state where he\'s unable to fend him off. With the help of Selenia and Betameche, he hatches a plan to regain his usual size: all they must do is infiltrate Arthur\'s house through the pipeworks, catch an electric train from his bedroom to his grandfather\'s study and find an elixir that will make him grow back to his human size. Sounds simple enough, if it weren\'t for Darkos, Maltazard\'s own son, hot on their tails.','https://image.tmdb.org/t/p/w500/wBT40NqmBz65WYmIGhDnWcgzPcA.jpg','2010-08-22',5.8,0),(21032,'Apostasy','en','A faithful Jehovah\'s Witness is forced to shun her own sister because of a religious transgression. As the separation draws out, she starts to question the meaning of God\'s love.','https://image.tmdb.org/t/p/w500/zjhVHDCCl2nwR1yCPZX4xw819Se.jpg','2017-09-29',6.9,0),(21033,'National Lampoon\'s European Vacation','en','The Griswalds win a vacation to Europe on a game show, and so pack their bags for the continent. They do their best to catch the flavor of Europe, but they just don\'t know how to be be good tourists. Besides, they have trouble taking holidays in countries where they CAN speak the language.','https://image.tmdb.org/t/p/w500/6AhVFxvDs2WZgfpC0bm2n2mshaa.jpg','1985-07-25',6.2,0),(21034,'Song of the South','en','Uncle Remus draws upon his tales of Br\'er Rabbit to help little Johnny deal with his confusion over his parents\' separation as well as his new life on the plantation.','https://image.tmdb.org/t/p/w500/lFlWpfcw8TCmZ88jw6e943vEbtu.jpg','1946-11-12',6.5,0),(21035,'Serenity','en','When the renegade crew of Serenity agrees to hide a fugitive on their ship, they find themselves in an action-packed battle between the relentless military might of a totalitarian regime who will destroy anything – or anyone – to get the girl back and the bloodthirsty creatures who roam the uncharted areas of space. But... the greatest danger of all may be on their ship.','https://image.tmdb.org/t/p/w500/8RX5bXJPXyZCzJBSLtvuVbNNQFW.jpg','2005-09-23',7.4,0),(21036,'Amigos','te','','https://image.tmdb.org/t/p/w500/mhPhEvh2ffBdbgiSIjrlkqAGwNH.jpg','2023-02-10',0,0),(21037,'Mary Poppins Returns','en','Mary Poppins returns to the Banks family and helps them evade grave dangers by taking them on magical, musical adventures.','https://image.tmdb.org/t/p/w500/uTVGku4LibMGyKgQvjBtv3OYfAX.jpg','2018-12-13',6.5,0),(21038,'Playing It Cool','en','A young man meets and instantly falls in love with an engaged woman.','https://image.tmdb.org/t/p/w500/96htqghZlKctNJqDLo2DuC9PEap.jpg','2014-09-26',5.9,0),(21039,'In Bruges','en','Ray and Ken, two hit men, are in Bruges, Belgium, waiting for their next mission. While they are there they have time to think and discuss their previous assignment. When the mission is revealed to Ken, it is not what he expected.','https://image.tmdb.org/t/p/w500/jMiBBqk72VRo1Y39x2ZbbenEU3a.jpg','2008-02-08',7.5,0),(21040,'Anon','en','Set in a near-future world where there is no privacy, ignorance or anonymity, our private memories are recorded and crime almost ceases to exist. In trying to solve a series of unsolved murders, Sal Frieland stumbles onto a young woman who appears to have subverted the system and disappeared. She has no identity, no history and no record. Sal realizes it may not be the end of crime but the beginning. Known only as \'The Girl\', Sal must find her before he becomes the next victim.','https://image.tmdb.org/t/p/w500/xhBTO9n3fxy3HJt7WlR9h9vvVmk.jpg','2018-05-03',5.9,0),(21041,'Merry Madagascar','en','The Zoosters are back in an all-new holiday adventure. When Santa and his reindeer crash onto the island of Madagascar it\'s up to Alex, Marty, Gloria, Melman and those wacky penguins to save Christmas. Get ready for a sleigh full of laughs in this hilarious new holiday classic.','https://image.tmdb.org/t/p/w500/s5nELMHR1L2agJXVIPiWxu6dWl8.jpg','2009-11-16',6.5,0),(21042,'Dragged Across Concrete','en','Two policemen, one an old-timer, the other his volatile younger partner, find themselves suspended when a video of their strong-arm tactics becomes the media\'s cause du jour. Low on cash and with no other options, these two embittered soldiers descend into the criminal underworld to gain their just due, but instead find far more than they wanted awaiting them in the shadows.','https://image.tmdb.org/t/p/w500/dQ9EkVyPYJNVCfP5jWXRe4faUFA.jpg','2018-09-03',6.6,0),(21043,'The Nightingale','en','In 1825, Clare, a 21-year-old Irish convict, chases a British soldier through the rugged Tasmanian wilderness, bent on revenge for a terrible act of violence he committed against her family. She enlists the services of an Aboriginal tracker who is also marked by trauma from his own violence-filled past.','https://image.tmdb.org/t/p/w500/hWA8QwSM1kJYMoTANEPoqrqBapg.jpg','2018-09-23',7.2,0),(21044,'Spectral','en','A special-ops team is dispatched to fight supernatural beings that have taken over a European city.','https://image.tmdb.org/t/p/w500/fYtIWhTDgPTcutD24f53Dcc7BAE.jpg','2016-12-09',6.4,0),(21045,'My Teacher, My Obsession','en','Riley is struggling to make friends after transferring to a new high school where her father, Chris, is an English teacher. When she meets Kyla, they quickly becomes close friends. However, the friendship takes a strange turn when Riley learns that Kyla is obsessed with her dad. Will Kyla successfully seduce Chris and start a twisted new life with him by removing everyone in her path, or will Riley be able to save her father from Kyla’s treacherous plot before it’s too late?','https://image.tmdb.org/t/p/w500/zrdhT7Mkk23M59cdV0aaiHLYQWs.jpg','2018-06-12',5,0),(21046,'V/H/S/2','en','Inside a darkened house looms a column of TVs littered with VHS tapes, a pagan shrine to forgotten analog gods. The screens crackle and pop endlessly with monochrome vistas of static white noise permeating the brain and fogging concentration. But you must fight the urge to relax: this is no mere movie night. Those obsolete spools contain more than just magnetic tape. They are imprinted with the very soul of evil.','https://image.tmdb.org/t/p/w500/o4hcWsHaHaNQ9BBReOxLvYJNRhA.jpg','2013-06-06',6.3,0),(21047,'The Last Castle','en','A court-martialed general rallies together 1200 inmates to rise against the system that put him away.','https://image.tmdb.org/t/p/w500/9OHuF3SFLc16XnSkosAAlFbI1YD.jpg','2001-10-19',7.1,0),(21048,'Little Lies','es','Amidst the problems in their childless marriage, Matías and Eva try their hand at matchmaking, setting up their friend Barbara with the man who seems perfect, Julián. Once they realize that Julian is not what he seems, they try to warn Barbara away, but she may already be too infatuated.','https://image.tmdb.org/t/p/w500/s3NoPF6LAKDl3KUGkZsYPX9ionc.jpg','2022-09-21',7.6,0),(21049,'Phobias','en','Five dangerous patients, suffering from extreme phobias at a government testing facility, are put to the ultimate test under the supervision of a crazed doctor and his quest to weaponize fear.','https://image.tmdb.org/t/p/w500/zpecci4IooFiwMVGknhm8Jz2FHo.jpg','2021-02-28',5.1,0),(21050,'Bonnie and Clyde','en','In the 1930s, bored waitress Bonnie Parker falls in love with an ex-con named Clyde Barrow and together they start a violent crime spree through the country, stealing cars and robbing banks.','https://image.tmdb.org/t/p/w500/hr7HVAcC9ZiUvfwApuha7i4leyP.jpg','1967-07-18',7.5,0),(21051,'Animal Instincts II','en','An unhappy divorcée has the bad fortune to move next door to a security systems installer, a voyeur whose hobby is planting hidden video cameras in the bedrooms of all his clients. He then monitors the sex lives of his customers through an elaborate TV monitor system in his garage. Joanna Cole becomes his latest victim, but when she discovers the camera by accident, she reverts back to her exhibitionist ways and begins putting on sex shows for his pleasure. Things gets ugly when Jim professes his love for her but is rebuffed.','https://image.tmdb.org/t/p/w500/3WWNA5QGUrCztY7Wvj3Z6guFctA.jpg','1994-08-24',2.6,0),(21052,'Free Willy 2: The Adventure Home','en','Jesse becomes reunited with Willy three years after the whale\'s jump to freedom as the teenager tries to rescue the killer whale and other orcas from an oil spill.','https://image.tmdb.org/t/p/w500/ixaRL2YZ1qjFfVqjdiUxRaJj2cY.jpg','1995-07-19',5.9,0),(21053,'The Silent Twins','en','Feeling isolated from that unwelcoming community, June and Jennifer Gibbons turn inward and reject communication with everyone but each other, retreating into their own fantasy world of artistic inspiration and adolescent desires.','https://image.tmdb.or