ure its safe return.','https://image.tmdb.org/t/p/w500/hGF0kp0nJqmcQzywSCjkt6eykE4.jpg','2004-07-12',6.2,0),(21060,'Drunken Master','cn','After being punished for getting into trouble, a mischievous young man is sent to train under a brutal, but slovenly old beggar, who teaches him the secret of the Drunken Fist.','https://image.tmdb.org/t/p/w500/cf43J2SH8tECZVl9N5n0Q6Ckche.jpg','1978-10-05',7.4,0),(21061,'Saludos Amigos','en','Live-action segments show members of the Disney staff touring South America and recording their impressions in sketches. These segue into four animated sections: \"Lake Titicaca\" depicts tourist Donald Duck\'s troubles with a stubborn llama; \"Pedro\" tells of a little mail plane\'s adventures flying over the treacherous Andes; \"El Gaucho Goofy\" transplants an American cowboy into the Argentine pampas; and in \"Aquarela do Brasil,\" Jose Carioca shows Donald the sights and sounds of Rio de Janiero.','https://image.tmdb.org/t/p/w500/jiNSrKpgKdLXEUasOvNaCBgEner.jpg','1942-08-24',5.9,0),(21062,'Lucky Number Slevin','en','Slevin is mistakenly put in the middle of a personal war between the city’s biggest criminal bosses. Under constant watch, Slevin must try not to get killed by an infamous assassin and come up with an idea of how to get out of his current dilemma.','https://image.tmdb.org/t/p/w500/x21s3p5wPww534nYj1cWakTcqz4.jpg','2006-02-24',7.5,0),(21063,'Sniper: Legacy','en','After several military leaders are assassinated, Brandon hears his father was one of the people killed. As he hunts the killers, Brandon learns his father is not dead, and he is being used as bait.','https://image.tmdb.org/t/p/w500/a9L1t3vRaZRU1Fa0kolfQGiTCnQ.jpg','2014-09-29',5.9,0),(21064,'Batman: Hush','en','A mysterious new villain known only as Hush uses a gallery of villains to destroy Batman\'s crime-fighting career as well as Bruce Wayne\'s personal life, which has been further complicated by a relationship with Selina Kyle/Catwoman.','https://image.tmdb.org/t