uspicious of the elderly couple who take him in to nurse him back to health with the ancient remedies.','https://image.tmdb.org/t/p/w500/4rjHhj1BAREc9zNFU8FheLJQdFf.jpg','2020-10-30',6.5,0),(21078,'tick, tick... BOOM!','en','On the cusp of his 30th birthday, Jonathon Larson, a promising young theater composer, navigates love, friendship, and the pressures of life as an artist in New York City.','https://image.tmdb.org/t/p/w500/3wW33TlWrmWi6YOJKrv1KGSoIdI.jpg','2021-11-11',7.7,0),(21079,'Assassins','en','Assassin Robert Rath arrives at a funeral to kill a prominent mobster, only to witness a rival hired gun complete the job for him -- with grisly results. Horrified by the murder of innocent bystanders, Rath decides to take one last job and then return to civilian life. But finding his way out of the world of contract killing grows ever more dangerous as Rath falls for his female target and becomes a marked man himself.','https://image.tmdb.org/t/p/w500/kgqS4jn60E8UIExfceMUExB3ZKK.jpg','1995-10-06',6.5,0),(21080,'The Escort','en','Desperate for a good story, a sex-addicted journalist throws himself into the world of high-class escorts when he starts following a Stanford-educated prostitute.','https://image.tmdb.org/t/p/w500/f0UUAhIBecyfUTjn3C3sw1UioUx.jpg','2015-11-05',6,0),(21081,'The True Story of Puss \'n Boots','fr','A free adaptation of Charles Perrault\'s famous Puss\'n Boots, \"The True Story of Puss\'n Boots\" is a story for young and old for the first time on cinema screens.','https://image.tmdb.org/t/p/w500/va4tC2RBC0uwpmq0cctruJmZgFs.jpg','2009-04-01',4.7,0),(21082,'Curse of the Blair Witch','en','Mockumentary about the Blair Witch legend and the three filmmakers who disappeared in October of 1999. It first aired on the Sci-Fi Channel on July 11, 1999 as a promotional prelude to the release of The Blair Witch Project on July 30, 1999.','https://image.tmdb.org/t/p/w500/e7AvQaI3k60HGGEso1t3KNjTuDW.jpg','1999-07-11',6.2,0),(21083,'The Mauritanian','en','The true story of the Mauritanian Mohamedou Ould Slahi, who was held at the U.S military\'s Guantanamo Bay detention center without charges for over a decade and sought help from a defense attorney for his release.','https://image.tmdb.org/t/p/w500/lIADEa6oH74uUapjsPbNRzxus8M.jpg','2021-02-10',7.4,0),(21084,'Mr. Vampire II','cn','Modern grave robbing \"archeologists\" find perfectly preserved specimens from the past of a man, a woman, and their child. Unbeknownst to the scientist and his two bumbling assistants, these are vampires immobilized only by the paper spells pasted on their foreheads. While transporting the child to a buyer, its spell blows off and the vampire child escapes and befriends some local children. Eventually, the parent vampires are also awakened and escape, but by now the local herbalist is on their trail to destroy them.','https://image.tmdb.org/t/p/w500/elM75iiWwerPkUO9wUlDWktX1z8.jpg','1986-08-15',6.7,0),(21085,'La Haine','fr','After a chaotic night of rioting in a marginal suburb of Paris, three young friends, Vinz, Hubert and Saïd, wander around unoccupied waiting for news about the state of health of a mutual friend who has been seriously injured when confronting the police.','https://image.tmdb.org/t/p/w500/8rgPyWjYZhsphSSxbXguMnhN7H0.jpg','1995-05-31',8.1,0),(21086,'In for a Murder','pl','A stay-at-home mom and avid reader of crime stories discovers the deepest secrets of a small town\'s residents while investigating a woman\'s murder.','https://image.tmdb.org/t/p/w500/tq5ODEgr1PUxT7HCqDT73SlDIek.jpg','2021-06-18',6.3,0),(21087,'The Butterfly Effect 2','en','After his girlfriend, Julie, and two best friends are killed in a tragic auto accident, Nick struggles to cope with his loss and grief. Suffering from migraine-like seizures, Nick soon discovers that he has the power to change the past via his memories. However, his time-traveling attempts to alter the past and save his one true love have unexpected and dire consequences.','https://image.tmdb.org/t/p/w500/wDvCGDASXlwyDgwEd920E5iBXpj.jpg','2006-08-17',4.9,0),(21088,'The Twelve Tasks of Asterix','fr','Asterix and Obelix depart on an adventure to complete twelve impossible tasks to prove to Caesar that they are as strong as the Gods. You\'ll roar with laughter as they outwit, outrun, and generally outrage the very people who are trying to prove them \"only human\".','https://image.tmdb.org/t/p/w500/7cZQZOYZFJcLjZnxWjO5PcUtmDZ.jpg','1976-06-26',7.4,0),(21089,'We Are the Nobles','es','Tells the \"riches to rags\" story of the Nobles, three upper-class twenty-somethings that appear to have no limits to their checkbooks, and no direction in their lives. Until one day, their father tries to teach them a lesson by staging a financial scandal that forces the whole family to escape to an old house in the poor side of town, and leads the \"kids\" to do what they haven\'t done before: get jobs.','https://image.tmdb.org/t/p/w500/wsj9TvkL6Uh9leY08nuyE4OhOXW.jpg','2013-03-28',7.9,0),(21090,'Swordfish','en','Rogue agent Gabriel Shear is determined to get his mitts on $9 billion stashed in a secret Drug Enforcement Administration account. He wants the cash to fight terrorism, but lacks the computer skills necessary to hack into the government mainframe. Enter Stanley Jobson, a n\'er-do-well encryption expert who can log into anything.','https://image.tmdb.org/t/p/w500/mM6h4jMqC4q5IaFgBIGKQDLnRU.jpg','2001-06-07',6.2,0),(21091,'Kandisha','fr','One summer evening, three childhood friends invoke the spirit of Kandisha, a vengeful creature from a Moroccan legend. The game quickly turns into a nightmare when their loved ones begin to disappear.','https://image.tmdb.org/t/p/w500/vgmy1DUrCiakFswahLjEWFGtBhm.jpg','2022-03-24',6,0),(21092,'The Trip','no','A dysfunctional couple head to a remote lakeside cabin under the guise of reconnecting, but each has secret designs to kill the other. Before they can carry out their respective plans, unexpected visitors arrive and the couple is faced with a greater danger than anything they could have plotted.','https://image.tmdb.org/t/p/w500/ygTIsPG7dREi5AlO0S9EMbmvdae.jpg','2021-07-30',6.7,0),(21093,'Howards End','en','A saga of class relations and changing times in an Edwardian England on the brink of modernity, the film centers on liberal Margaret Schlegel, who, along with her sister Helen, becomes involved with two couples: wealthy, conservative industrialist Henry Wilcox and his wife Ruth, and the downwardly mobile working-class Leonard Bast and his mistress Jackie.','https://image.tmdb.org/t/p/w500/1009nhfj28VhhQnVadtjkOacduX.jpg','1992-03-13',7,0),(21094,'Green Snake','zh','While trying to free her sister from Fahai\'s clutches, Xiao Qing winds up in a dystopian city and meets a mysterious man who can\'t recall his past life.','https://image.tmdb.org/t/p/w500/1zs5zsQDP5KuWwxIg9EUULLFEV.jpg','2021-07-23',8.3,0),(21095,'The Highwaymen','en','In 1934, Frank Hamer and Manny Gault, two former Texas Rangers, are commissioned to put an end to the wave of vicious crimes perpetrated by Bonnie Parker and Clyde Barrow, a notorious duo of infamous robbers and cold-blooded killers who nevertheless are worshiped by the public.','https://image.tmdb.org/t/p/w500/4bRYg4l12yDuJvAfqvUOPnBrxno.jpg','2019-03-15',6.7,0),(21096,'Cool Hand Luke','en','When petty criminal Luke Jackson is sentenced to two years in a Florida prison farm, he doesn\'t play by the rules of either the sadistic warden or the yard\'s resident heavy, Dragline, who ends up admiring the new guy\'s unbreakable will. Luke\'s bravado, even in the face of repeated stints in the prison\'s dreaded solitary confinement cell, \"the box,\" make him a rebel hero to his fellow convicts and a thorn in the side of the prison officers.','https://image.tmdb.org/t/p/w500/4ykzTiHKLamh3eZJ8orVICtU2Jp.jpg','1967-06-22',7.7,0),(21097,'Slugterra: Slug Fu Showdown','en','Eli has added some awesome new slugs to his arsenal: the extremely powerful Elemental Slugs. But in order to control them, Eli must learn Slug Fu -- the ancient form of slugslinging that Junjie mastered in the Eastern Caverns.','https://image.tmdb.org/t/p/w500/9IrfRT8stzY3xh9y0SEBraNhm3E.jpg','2015-02-10',6.9,0),(21098,'Punisher: War Zone','en','Waging his one-man war on the world of organized crime, ruthless vigilante-hero Frank Castle sets his sights on overeager mob boss Billy Russoti. After Russoti is left horribly disfigured by Castle, he sets out for vengeance under his new alias: Jigsaw. With the \"Punisher Task Force\" hot on his trail and the FBI unable to take Jigsaw in, Frank must stand up to the formidable army that Jigsaw has recruited before more of his evil deeds go unpunished.','https://image.tmdb.org/t/p/w500/oOvKJgYUIpfswGHAdW6159bPbvM.jpg','2008-12-05',5.8,0),(21099,'Parallel Mothers','es','Two unmarried women who have become pregnant by accident and are about to give birth meet in a hospital room: Janis, middle-aged, unrepentant and happy; Ana, a teenager, remorseful and frightened.','https://image.tmdb.org/t/p/w500/gDaxYkYNbHuM2VlUazbcpnFZB6d.jpg','2021-10-08',6.9,0),(21100,'The Man with the Iron Fists 2','en','When a stranger, Thaddeus, is found badly wounded near the village, miner Li Kung and his wife Ah Ni offer him refuge. As he heals, he becomes entrenched in a conflict that pits the townsfolk against the evil Master Ho, his nefarious Beetle Clan and the terrifying Lord Pi.','https://image.tmdb.org/t/p/w500/n1U7x2OMsyI28auLY3U9XB3udl7.jpg','2015-03-10',5.6,0),(21101,'Resort to Love','en','Aspiring pop star Erica ends up as the entertainment at her ex-fiancé’s wedding after reluctantly taking a gig at a luxurious island resort while in the wake of a music career meltdown.','https://image.tmdb.org/t/p/w500/6TrkFcgCF8Vznk45rs3qvxxejiV.jpg','2021-07-29',7.3,0),(21102,'ariana grande: excuse me, i love you','en','Ariana Grande takes the stage in London for her Sweetener World Tour and shares a behind-the-scenes look at her life in rehearsal and on the road.','https://image.tmdb.org/t/p/w500/cvBVd5DwAwYOakF0U1qsYdysQ08.jpg','2020-12-21',8.3,0),(21103,'The Machinist','en','Trevor, an insomniac lathe operator, experiences unusual occurrences at work and home. A strange man follows him everywhere, but no one else seems to notice him.','https://image.tmdb.org/t/p/w500/diAYqR4xdF9Hnj7qun6DEQhRrT2.jpg','2004-02-09',7.5,0),(21104,'Ender\'s Game','en','Based on the classic novel by Orson Scott Card, Ender\'s Game is the story of the Earth\'s most gifted children training to defend their homeplanet in the space wars of the future.','https://image.tmdb.org/t/p/w500/hEioY3LlqBwvIpZeZuR1BMaAgv1.jpg','2013-10-24',6.6,0),(21105,'Winnie the Pooh: Springtime with Roo','en','Spring has sprung, and baby Roo is excited to get out and explore and make new friends. But Rabbit seems preoccupied with spring cleaning, instead of embracing his usual role of playing Easter Bunny. Leave it to Roo to show Rabbit -- through love -- that it\'s more important who you love and not who\'s in charge.','https://image.tmdb.org/t/p/w500/yAgVcU1BdPqvnyYnOkb1QtVNd5V.jpg','2004-03-09',6.7,0),(21106,'Black Box','en','After losing his wife and his memory in a car accident, a single father undergoes an experimental treatment that causes him to question who he really is.','https://image.tmdb.org/t/p/w500/ldlpTitpSTBINwgifzlRRXveXUF.jpg','2020-10-06',6.5,0),(21107,'The Legacy of Chucky','en','A celebration of the 30+ year legacy of the Child’s Play franchise and iconic character, Chucky, with never-before-seen interviews with franchise creator and actors.','https://image.tmdb.org/t/p/w500/xDUsJtuTuwmBeQPAiYqLD490sSF.jpg','2021-07-25',6.5,0),(21108,'An Officer and a Gentleman','en','Zack Mayo is an aloof, taciturn man who aspires to be a navy pilot. Once he arrives at training camp for his 13-week officer\'s course, Mayo runs afoul of abrasive, no-nonsense drill Sergeant Emil Foley. Mayo is an excellent cadet, but a little cold around the heart, 