ly, always appear to defend Sol until the last consequences.','https://image.tmdb.org/t/p/w500/cYNfI1WHxMm0JhCXEX9qUUOv8C3.jpg','2021-10-09',5.4,0),(21113,'Monte Carlo','en','Three young women vacationing in Paris find themselves whisked away to Monte Carlo after one of the girls is mistaken for a British heiress.','https://image.tmdb.org/t/p/w500/dcbqyycrWA56HXq5lm41HYuED8Y.jpg','2011-07-01',6.6,0),(21114,'The Strangers','en','After returning from a wedding reception, a couple staying in an isolated vacation house receive a knock on the door in the mid-hours of the night. What ensues is a violent invasion by three strangers, their faces hidden behind masks. The couple find themselves in a violent struggle, in which they go beyond what either of them thought capable in order to survive.','https://image.tmdb.org/t/p/w500/9zsA2xafNMA8BQmpQLdppLIGYAE.jpg','2008-05-29',6.1,0),(21115,'A Cinderella Story: Christmas Wish','en','Kat is an aspiring singer-songwriter who dreams of making it big. However, her dreams are stalled by her reality: a conniving and cruel stepfamily  and a demoralizing job working as a singing elf at billionaire Terrence Wintergarden’s Santa Land.','https://image.tmdb.org/t/p/w500/ozBX0u5caaJFli9AssqJmARb5R.jpg','2019-10-15',6.4,0),(21116,'Oppenheimer','en','The story of J. Robert Oppenheimer’s role in the development of the atomic bomb during World War II.','https://image.tmdb.org/t/p/w500/bAFmcrCpXsJis5q0aaXvCz3dTiX.jpg','2023-07-19',0,0),(21117,'A Time to Kill','en','A young lawyer defends a black man accused of murdering two white men who raped his 10-year-old daughter, sparking a rebirth of the KKK.','https://image.tmdb.org/t/p/w500/apUSR9WE7lMATBGYhzZ8RnPDYsK.jpg','1996-07-24',7.4,0),(21118,'Superman: Unbound','en','Superman and Supergirl take on the cybernetic being known as Brainiac, who boasts that he possesses \"the knowledge and strength of 10,000 worlds.\"','https://image.tmdb.org/t/p/w500/eClisUhexQO3ofrge3RtDQZqDq8.jpg','2013-04-23',6.7,0),(21119,'Rock Dog','en','When a radio falls from the sky into the hands of a wide-eyed Tibetan Mastiff, he leaves home to fulfill his dream of becoming a musician, setting into motion a series of completely unexpected events.','https://image.tmdb.org/t/p/w500/7RXi2afiNJGU8EB79SD8HYoSz4O.jpg','2016-07-08',6.2,0),(21120,'From Hell','en','Frederick Abberline is an opium-huffing inspector from Scotland Yard who falls for one of Jack the Ripper\'s prostitute targets in this Hughes brothers adaption of a graphic novel that posits the Ripper\'s true identity.','https://image.tmdb.org/t/p/w500/t2WpWM8nBO4sULXr2bDfNEt4qgr.jpg','2001-02-08',6.7,0),(21121,'The Secret Life of Pets','en','The quiet life of a terrier named Max is upended when his owner takes in Duke, a stray whom Max instantly dislikes.','https://image.tmdb.org/t/p/w500/hfsoAEE3MdTy9SLlGnez9iR9Mch.jpg','2016-06-18',6.3,0),(21122,'The Shamer\'s Daughter II: The Serpent Gift','da','The Shamer\'s Daughter, Dina, with the magical power of compelling people to admit their most secret shame, must save her family with her newly found father. But he is a Blackmaster, with the power to make people see and believe things that aren\'t true, so Dina must deal with having inherited this horrible power, while forging a relationship with a father she fears and mistrusts.','https://image.tmdb.org/t/p/w500/zQXYZW4hTZyBBr8gS1CJ4CdDxAq.jpg','2019-01-24',6.3,0),(21123,'Labor Day','en','Depressed single mom Adele and her son Henry offer a wounded, fearsome man a ride. As police search town for the escaped convict, the mother and son gradually learn his true story as their options become increasingly limited.','https://image.tmdb.org/t/p/w500/f7k1VJOMXrABW67P0zhzxEVv2oe.jpg','2013-12-27',7,0),(21124,'Lawless','en','In 1931, the Bondurant brothers of Franklin County, Virginia, run a multipurpose backwoods establishment that hides their true business — bootlegging. Middle brother Forrest is the brain of the operation; older Howard is the brawn, and younger Jack, the lookout. Though the local police have taken bribes and left the brothers alone, a violent war erupts when a sadistic lawman from Chicago arrives and tries to shut down the Bondurants operation.','https://image.tmdb.org/t/p/w500/Ahtzwts22ayviD3LEVslfL4nRWB.jpg','2012-08-29',7,0),(21125,'Maid in Malacañang','tl','The untold story of the last 72 hours of the Marcoses inside Malacañang Palace before fleeing to Hawaii, during the 1986 People Power Revolution.','https://image.tmdb.org/t/p/w500/8ukeEdnTaS74CgRiRsV146uZCDA.jpg','2022-08-03',3.2,0),(21126,'Slither','en','A small town is taken over by an alien plague, turning residents into zombies and all forms of mutant monsters.','https://image.tmdb.org/t/p/w500/7D4ZS7LUnc89ptIt0yW7L4SYPOG.jpg','2006-03-31',6.5,0),(21127,'BlackBerry','en','Follows the rise and fall of the BlackBerry, the once-ubiquitous device, exploring how its Canadian parent company lost its market advantage to competitors, and the business relationship between its co-founders.','https://image.tmdb.org/t/p/w500/ma3LmygsNY1i8t7TcWN4jfv0M5N.jpg','2023-02-13',0,0),(21128,'In the Tall Grass','en','After hearing a child screaming for help from the green depths of a vast field of tall grass, Becky, a pregnant woman, and Cal, her brother, park their car near a mysterious abandoned church and recklessly enter the field, discovering that they are not alone and because of some reason they are unable of escaping a completely inextricable vegetable labyrinth.','https://image.tmdb.org/t/p/w500/1RxhzwFkAUqMt215Brb06u8P8pn.jpg','2019-09-20',5.5,0),(21129,'Stardust','en','In a countryside town bordering on a magical land, a young man makes a promise to his beloved that he\'ll retrieve a fallen star by venturing into the magical realm. His journey takes him into a world beyond his wildest dreams and reveals his true identity.','https://image.tmdb.org/t/p/w500/AsCrevARwF6eCrF2v8zpLdn0gth.jpg','2007-08-09',7.2,0),(21130,'The Girl Next Door','en','In a quiet suburban town in the summer of 1958, two recently orphaned sisters are placed in the care of their mentally unstable Aunt Ruth. But Ruth\'s depraved sense of discipline will soon lead to unspeakable acts of abuse and torture that involve her young sons, the neighborhood children, and one 12-year-old boy whose life will be changed forever.','https://image.tmdb.org/t/p/w500/dXjLp7k7ILyg22T0s9VvpPKc9jn.jpg','2007-07-19',6.7,0),(21131,'The Silencing','en','A reformed hunter becomes involved in a deadly game of cat and mouse when he and the local sheriff set out to track a vicious killer who may have kidnapped his daughter years ago.','https://image.tmdb.org/t/p/w500/dnN1ncxEOO1TY0gYL2FWxJqlhlL.jpg','2020-07-18',6.5,0),(21132,'Amulet','en','Tomaz, an ex-soldier now homeless in London, is offered a place to stay at a decaying house, inhabited by a young woman and her dying mother. As he starts to fall for Magda, Tomaz cannot ignore his suspicion that something insidious might also be living alongside them.','https://image.tmdb.org/t/p/w500/kEVyAkEkpwpfyx4oZMg22A8ivDI.jpg','2020-07-24',5.4,0),(21133,'Army of One','en','Out hiking, Special Forces Brenner Baker stumbles onto a Cartel\'s compound. Her husband\'s killed and she\'s left for dead. The Cartel made two mistakes, killed her husband and left her alive. They won\'t live to make another.','https://image.tmdb.org/t/p/w500/oswZEJav9ymqIc9B1cjA9Pz2tj1.jpg','2020-12-14',6,0),(21134,'Colossal','en','A woman discovers that severe catastrophic events are somehow connected to the mental breakdown from which she\'s suffering.','https://image.tmdb.org/t/p/w500/4VOyofBd1pexblxtDZYtYIk7NI4.jpg','2017-04-06',6.3,0),(21135,'The Pelican Brief','en','A law student\'s theory about the recent deaths of two Supreme Court justices embroils her in a far-reaching web of murder, corruption, and greed.','https://image.tmdb.org/t/p/w500/1V9B0fk3dh2Af2yUI5mAEETJNNT.jpg','1993-09-17',6.6,0),(21136,'La conjura de El Escorial','es','16th century ruler King Philip II of Spain maneuvers within a court of deceit and betrayal','https://image.tmdb.org/t/p/w500/tVuWHqaLboafKxU5rSGnwdnyR6f.jpg','2008-09-05',4.4,0),(21137,'Funny Face','en','A shy Greenwich Village book clerk is discovered by a fashion photographer and whisked off to Paris where she becomes a reluctant model.','https://image.tmdb.org/t/p/w500/1CW8Wn2itBQ7wACBQHpOyIbPpmD.jpg','1957-02-13',7,0),(21138,'Beverly Hills Cop II','en','Axel heads for the land of sunshine and palm trees to find out who shot police Captain Andrew Bogomil. Thanks to a couple of old friends, Axel\'s investigation uncovers a series of robberies masterminded by a heartless weapons kingpin—and the chase is on.','https://image.tmdb.org/t/p/w500/egDakU8O5yUwpUJP9IMAUVtIDll.jpg','1987-05-18',6.5,0),(21139,'Baby Face','en','A young woman uses her body and her sexuality to help her climb the social ladder, but soon begins to wonder if her new status will ever bring her happiness.','https://image.tmdb.org/t/p/w500/uxoFdrx70e9dwAUngwfOZyLF4Y1.jpg','1933-07-13',7.3,0),(21140,'Smokey and the Bandit II','en','The Bandit goes on another cross-country run, transporting an elephant from Florida to Texas. And, once again, Sheriff Buford T. Justice is on his tail.','https://image.tmdb.org/t/p/w500/h1RMIa9rzcEoV1em82cynUnOwP7.jpg','1980-08-15',5.6,0),(21141,'The Gunman','en','Eight years after fleeing the Congo following his assassination of that country\'s minister of mining, former assassin Jim Terrier is back, suffering from PTSD and digging wells to atone for his violent past. After an attempt is made on his life, Terrier flies to London to find out who wants him dead -- and why. Terrier\'s search leads him to a reunion with Annie, a woman he once loved, who is now married to an oily businessman with dealings in Africa.','https://image.tmdb.org/t/p/w500/lnUozDnDANTsDYEdsNsHC6b8IiS.jpg','2015-02-16',5.7,0),(21142,'Rampage','en','The boredom of small town life is eating Bill