n for a real case of culture shock after discovering he\'s living in a place where music and dancing are illegal.','https://image.tmdb.org/t/p/w500/9JEDjBCXCx3eKTSkXwispf0UN3O.jpg','1984-02-17',6.7,0),(21153,'Daughter','en','A young woman is kidnapped and inducted into a bizarre family as their new surrogate daughter. As she navigates through this twisted dynamic, awful secrets about the past are revealed, leading to even darker implications about the future.','https://image.tmdb.org/t/p/w500/7mKVqsEamDgzPSyPSbMURCGUFOr.jpg','2023-02-10',2,0),(21154,'Mysterious Skin','en','A teenage hustler and a young man obsessed with alien abductions cross paths, together discovering a horrible, liberating truth.','https://image.tmdb.org/t/p/w500/lXid6RymzAhXiYqMvbvNnbNx5f6.jpg','2005-03-30',7.5,0),(21155,'Ne Zha','zh','The Primus extracts a Mixed Yuan Bead into a Spirit Seed and a Demon Pill. The Spirit Seed can be reincarnated as a human to help King Zhou establish a new dynasty, whereas the Demon Pill will create a devil threatening humanity. Ne Zha is the one who is destined to be the hero, but instead he becomes a devil incarnate, because the Spirit Seed and a Demon Pill are switched.','https://image.tmdb.org/t/p/w500/vhnxaQel1CwfcwLtCkTNpSdjte1.jpg','2019-07-26',7.9,0),(21156,'Doctor Zhivago','en','The life of a Russian physician and poet who, although married to another, falls in love with a political activist\'s wife and experiences hardship during World War I and then the October Revolution.','https://image.tmdb.org/t/p/w500/r0Iv2BiCFYDnzc6uU1q3AJ56igT.jpg','1965-12-22',7.5,0),(21157,'Promising Young Woman','en','A young woman, traumatized by a tragic event in her past, seeks out vengeance against those who crossed her path.','https://image.tmdb.org/t/p/w500/73QoFJFmUrJfDG2EynFjNc5gJxk.jpg','2020-12-13',7.5,0),(21158,'Om Shanti Om','hi','Reincarnated 30 years after being killed in a suspicious on-set fire, a small-time actor is determined to punish the person who ignited the blaze.','https://image.tmdb.org/t/p/w500/hQrwdiacMM5XDUkKdv3pCS6VFt8.jpg','2007-11-07',7.1,0),(21159,'Malcolm & Marie','en','As a filmmaker and his girlfriend return home from his movie premiere, smoldering tensions and painful revelations push them toward a romantic reckoning.','https://image.tmdb.org/t/p/w500/bdidDnAZwchN5vTenoNuhGPJTri.jpg','2021-01-29',7.1,0),(21160,'Popeye','en','Popeye is a super-strong, spinach-scarfing sailor man who\'s searching for his father. During a storm that wrecks his ship, Popeye washes ashore and winds up rooming at the Oyl household, where he meets Olive. Before he can win her heart, he must first contend with Olive\'s fiancé, Bluto.','https://image.tmdb.org/t/p/w500/nEZvWagf18UXGNzvIAQaMSGTEYA.jpg','1980-12-12',5.4,0),(21161,'Robin-B-Hood','cn','For never-do-well compulsive gambler Fong, there\'s only one thing more fearsome than debtors at his doorstep - having to coax a crying baby. But what if the baby becomes his golden goose to fend off his debtors? Can he overcome his phobia of diapers, milk bottles, and cloying lullabies?','https://image.tmdb.org/t/p/w500/aJZ8i1KEy5Kdc6hXNlLiHOlhdTA.jpg','2006-09-28',7,0),(21162,'Fantastic Beasts 4','en','The fourth installment of the \'Fantastic Beasts and Where to Find Them\' series which follows the adventures of Newt Scamander.','https://image.tmdb.org/t/p/w500/hRHkrmHx3wamc1cSazepEoyBays.jpg',NULL,0,0),(21163,'Flatliners','en','Five medical students, hoping to understand the mystery of what lies beyond life, embark on a dangerous experiment. When their hearts are stopped for a short period of time, they have a near-death experience…','https://image.tmdb.org/t/p/w500/e9NHATN0TJW6ZZPLLWFsKdilVl1.jpg','2017-09-28',5.7,0),(21164,'Æon Flux','en','400 years into the future, disease has wiped out the majority of the world\'s population, except one walled city, Bregna, ruled by a congress of scientists. When Æon Flux, the top operative in the underground \'Monican\' rebellion, is sent on a mission to kill a government leader, she uncovers a world of secrets.','https://image.tmdb.org/t/p/w500/5958Nt4QX6aRSUdQnvNw8wqjTJQ.jpg','2005-11-30',5.6,0),(21165,'Luther: The Fallen Sun','en','A gruesome serial killer is terrorizing London while brilliant but disgraced detective John Luther sits behind bars. Haunted by his failure to capture the cyber psychopath who now taunts him, Luther decides to break out of prison to finish the job by any means necessary.','https://image.tmdb.org/t/p/w500/70CpAMHRS7muBnkpqbXc9DjMHTQ.jpg','2023-02-24',0,0),(21166,'In the Earth','en','As a deadly virus ravages the world, Dr. Martin Lowery embarks on a mission to reach test site ATU327A, a research hub deep in the Arboreal Forest. The arduous journey, guided by park scout Alma, is set back by a nighttime attack that leaves the two bruised and shoeless. When they run into Zach, a man living off the grid, they gratefully accept his help. Zach’s intentions aren’t exactly what they seem, however, and a path out of the forest and into safety quickly fades as the line between myth and science blurs.','https://image.tmdb.org/t/p/w500/lzzUkcZyHbXJayCw8yNAPezdBhq.jpg','2021-04-16',5.8,0),(21167,'Lethal Weapon 3','en','Archetypal buddy cops Riggs and Murtaugh are back for another round of high-stakes action, this time setting their collective sights on bringing down a former Los Angeles police lieutenant turned black market weapons dealer. Lorna Cole joins as the beautiful yet hardnosed internal affairs sergeant who catches Riggs\'s eye.','https://image.tmdb.org/t/p/w500/8FnOudDHPOY7MFJnvQMR1qpuyek.jpg','1992-05-15',6.7,0),(21168,'Muppets Haunted Mansion','en','Gonzo is challenged to spend one night in The Haunted Mansion on Halloween night.','https://image.tmdb.org/t/p/w500/yTQbZCxZ4amGZKC9ETjTr7ZAH7L.jpg','2021-10-08',6.6,0),(21169,'Love','fr','Murphy is an American living in Paris who enters a highly sexually and emotionally charged relationship with the unstable Electra. Unaware of the seismic effect it will have on their relationship, they invite their pretty neighbor into their bed.','https://image.tmdb.org/t/p/w500/21UExtLnYmeH6sAxD4zdlrb5PG6.jpg','2015-07-06',6.5,0),(21170,'The Book of Henry','en','Susan, a single mother of two, works as a waitress in a small town. Her son, Henry, is an 11-year-old genius who not only manages the family finances but acts as emotional support for his mother and younger brother. When Henry discovers that the girl next door has a terrible secret, he implores Susan to take matters into her own hands.','https://image.tmdb.org/t/p/w500/suLFg4UjvM5BoDipg2Wu3gZ802T.jpg','2017-06-16',7.5,0),(21171,'I Used to Be Famous','en','A former boy band star unexpectedly gets a second shot at success when he forms a bond with a gifted young drummer.','https://image.tmdb.org/t/p/w500/hJMnsf6vzgoNx0bv3uh3PTCjmks.jpg','2022-09-09',7.2,0),(21172,'Rat Race','en','In an ensemble film about easy money, greed, manipulation and bad driving, a Las Vegas casino tycoon entertains his wealthiest high rollers -- a group that will bet on anything -- by pitting six ordinary people against each other in a wild dash for $2 million jammed into a locker hundreds of miles away. The tycoon and his wealthy friends monitor each racer\'s every move to keep track of their favorites. The only rule in this race is that there are no rules.','https://image.tmdb.org/t/p/w500/8ghNCfFbCJjcNSz2K5jOC3eO6ZD.jpg','2001-08-17',6.2,0),(21173,'Green Lantern: First Flight','en','Test pilot Hal Jordan finds himself recruited as the newest member of the intergalactic police force, The Green Lantern Corps.','https://image.tmdb.org/t/p/w500/zma3rOg6yJxgJ1Lo9uuw3tJOjbZ.jpg','2009-07-28',6.9,0),(21174,'God, Sex and Truth','en','\'God, Sex and Truth\' delves into the world of sex where it digs out and projects the deepest dignity, divinity of the act and a women\'s true purpose of her sexuality.','https://image.tmdb.org/t/p/w500/vaqtTC12oX94ChZUljXRz4fw2ch.jpg','2018-01-27',6.5,0),(21175,'Winchester','en','San Jose, California, 1906. Isolated in her labyrinthine mansion, eccentric firearm heiress Sarah Winchester believes that she is being haunted by the souls of those killed by the guns manufactured by her company.','https://image.tmdb.org/t/p/w500/tHDtskokZeO9B3JBdR1dSH0uqad.jpg','2018-02-02',5.9,0),(21176,'Born to Be Human','zh','Yang Shi-Nan is a 14-year-old boy who undergoes a metamorphosis without realising what is going on. It begins on a normal school day when he gets stomach cramps. After rushing to the toilet he notices that his urine is turning bloody red. Taken to a doctor he is diagnosed with “Disorders of Sex Development,” or intersex. Without consulting him, Shi-Nan’s parents decide to accept “sex reassignment surgery”, turning Shi-Nan into a female and changing her name to YANG Shi-Lan. The family moves to a new city to start a new life and it all seems to be going well as Shi-Lan blends in and even makes friends. It seems like the butterfly is about to break out of its chrysalis but can Yang Shi-Lan truly embrace her transformation?','https://image.tmdb.org/t/p/w500/i8Sx02kiUUWnjLx5dxppihPzOVm.jpg','2021-12-03',5.3,0),(21177,'Gamer','en','Mind-control technology has taken society by a storm, a multiplayer on-line game called \"Slayers\" allows players to control human prisoners in mass-scale. Simon controls Kable, the online champion of the game. Kable\'s ultimate challenge becomes regaining his identity and independence by defeating the game\'s mastermind.','https://image.tmdb.org/t/p/w500/rfQtqLHeisaQ4HlYtNremtUl9oP.jpg','2009-09-03',5.7,0),(21178,'TMNT','en','After the defeat of their old arch nemesis, The Shredder, the Turtles have grown apart as a family. Struggling to keep them together, their rat sensei, Splinter, becomes worried when strange things begin to brew in New York City.','https://image.tmdb.org/t/p/w500/ksguZE9rTtsRJlhTO59WNmPNjOR.jpg','2007-03-23',6.1,0),(21179,'A Score to Settle','en','A former mob enforcer who is released from prison after serving 22 years for a crime he didn\'t commit sets out on a path for revenge against the people who wronged him.','https://image.tmdb.org/t/p/w500/4PBwZGBP6ziKuOgHRpbVRyGoqy3.jpg','2019-08-01',6,0),(21180,'One Fine Morning','fr','Sandra lives in a small apartment in Paris with her eight-year-old daughter. She regularly visits her father, Georg, who suffers from a neurodegenerative disease that undermines his capacities day by day. While she embarks with her family on an obstacle course through nursing homes to install Georg in a safe place, Sandra unexpectedly runs into Clément. Although he is not free, a passionate relationship begins.','https://image.tmdb.org/t/p/w500/oLmWB5Gjk6ncO7qX2OMybQD6Rkh.jpg','2022-10-05',7.3,0),(21181,'Irmão do Jorel: Especial Carnaval Bruttal','pt','','https://image.tmdb.org/t/p/w500/z5PaKPZ6UQUH4XMW4r1kt33m0KU.jpg','2022-02-25',6.3,0),(21182,'Balto','en','An outcast half-wolf risks his life to prevent a deadly epidemic from ravaging Nome, Alaska.','https://image.tmdb.org/t/p/w500/dCVcdb5oxDizqFLz0F7TE60NoC9.jpg','1995-12-22',7.3,0),(21183,'Night Train','en','Mother Holly McCord is driven to extremes to save the life of her young son. Even if it means hauling black market drugs in her souped-up truck, with the Feds in hot pursuit. With two bounties on her head and her son’s life on the line, Holly climbs behind the wheel of “Night Train,” ready to outrun, out gun, and outlast them all.','https://image.tmdb.org/t/p/w500/gRWWO0dqCRG6K8ZtRNVf8xrb1Ng.jpg','2023-01-13',7.4,0),(21184,'She Devils of the SS','de','In the last days of WW2, women are volunteering from all over Germany to serve in the front lines by having sex with the brave Nazi soldiers. But when they start having sex with each other, things get complicated. Especially with the increasing danger from the revengeful Soviet army!','https://image.tmdb.org/t/p/w500/qbH4t4n1xr04ry8GiLCIRCUTRYD.jpg','1973-01-01',4.1,0),(21185,'Dude, Where\