uble hits, June and her misfit team of furry friends begin an unforgettable journey to save the park.','https://image.tmdb.org/t/p/w500/8KomINZhIuJeB4oB7k7tkq8tmE.jpg','2019-03-13',6.4,0),(21190,'The Fog','en','Strange things begin to occurs as a tiny California coastal town prepares to commemorate its centenary. Inanimate objects spring eerily to life; Rev. Malone stumbles upon a dark secret about the town\'s founding; radio announcer Stevie witnesses a mystical fire; and hitchhiker Elizabeth discovers the mutilated corpse of a fisherman. Then a mysterious iridescent fog descends upon the village, and more people start to die.','https://image.tmdb.org/t/p/w500/gZmdq8HB8SBdOHk5XarjCZIiGGk.jpg','1980-02-08',6.7,0),(21191,'Murder on the Orient Express','en','In 1935, when his train is stopped by deep snow, detective Hercule Poirot is called on to solve a murder that occurred in his car the night before.','https://image.tmdb.org/t/p/w500/33LmWxGdj4hHE2HCTRZII1ZdMmQ.jpg','1974-11-22',7.2,0),(21192,'The Swan Princess','en','The beautiful princess Odette is transformed into a swan by an evil sorcerer\'s spell. Held captive at an enchanted lake, she befriends Jean-Bob the frog, Speed the turtle and Puffin the bird. Despite their struggle to keep the princess safe, these good-natured creatures can do nothing about the sorcerer\'s spell, which can only be broken by a vow of everlasting love.','https://image.tmdb.org/t/p/w500/f5YvIPrkJ9HCsNbgzWJJyxXVNhj.jpg','1994-11-18',6.6,0),(21193,'Nomadland','en','A woman in her sixties embarks on a journey through the western United States after losing everything in the Great Recession, living as a van-dwelling modern-day nomad.','https://image.tmdb.org/t/p/w500/8Vc5EOUEIF1EUXuX9eLFf7BvN3P.jpg','2020-12-04',7.3,0),(21194,'Halloween: Resurrection','en','Serial Killer Michael Myers is not finished with Laurie Strode, and their rivalry finally comes to an end. But is this the last we see of Myers? Freddie Harris and Nora Winston are reality programmers at DangerTainment, and are planning to send a group of 6 thrill-seeking teenagers into the childhood home of Myers. Cameras are placed all over the house and no one can get out of the house... and then Michael arrives home!','https://image.tmdb.org/t/p/w500/1mlKwbNzJCGzqe4i0ZEJtUUL290.jpg','2002-07-01',4.7,0),(21195,'Among the Beasts','en','When a gangster’s daughter reluctantly teams with a former Marine to find her kidnapped cousin, the combat veteran must overcome his own demons in order to rescue the child.','https://image.tmdb.org/t/p/w500/5EZm65PVB6T6NIwvE17Q3lQ6Pok.jpg','2023-02-10',0,0),(21196,'Monster High: Why Do Ghouls Fall in Love?','en','Draculaura’s Sweet 1600th birthday is an extra special occasion to party at Monster High! But her high expectations lead to deadly results when she’s faced with the choice between practical boyfriend Clawd, and new vampire heartthrob, Valentine, a romantic blast from her past. Her ghoulfriends find it odd that Valentine created a holiday in her honor, but oddly named it after himself (how romantic?) and have to stop him before he steals her heart… literally. Draculaura must decide which boy is right for her before the party! Will she find out about Valentine’s sinister plan? Will her best ghoulfriends be able to help her in time? And most importantly… will Draculaura pass her driving test?','https://image.tmdb.org/t/p/w500/ehsu0cjPtivGSHn0tuoFpRXKpuN.jpg','2012-02-12',7.9,0),(21197,'Before Sunrise','en','On his way to Vienna, American Jesse meets Céline, a student returning to Paris. After long conversations forge a surprising connection between them, Jesse convinces Celine to get off the train with him in Vienna. Since his flight to the U.S. departs the next morning and he has no money for lodging, they wander the city together, taking in the experiences of Vienna and each other.','https://image.tmdb.org/t/p/w500/aZ2Vkrc4RqIjewYbmfy74oDgZfX.jpg','1995-01-27',8,0),(21198,'Batman and Harley Quinn','en','Batman and Nightwing are forced to team with the Joker\'s sometimes-girlfriend Harley Quinn to stop a global threat brought about by Poison Ivy and Jason Woodrue, the Floronic Man.','https://image.tmdb.org/t/p/w500/zZVVSdgrOr1QIlcxcobQHG4IQyA.jpg','2017-08-14',6.1,0),(21199,'Rage','en','When the Russian mob kidnaps the daughter of a reformed criminal, he rounds up his old crew and seeks his own brand of justice.','https://image.tmdb.org/t/p/w500/1pC6xTd15iLIs5De7JKQfrDmKyd.jpg','2014-05-09',5.3,0),(21200,'Under Wraps','en','Three friends try to save their mummified friend, Harold, from greedy criminals by returning him to his resting place before midnight on Halloween.','https://image.tmdb.org/t/p/w500/2EnHRyHdboUWz120LDiAk2M2Lgc.jpg','2021-10-01',6.9,0),(21201,'Mad God','en','A figure known as \"The Assassin\" descends from the heavens into a nightmarish pit full of monsters, titans, and cruelty.','https://image.tmdb.org/t/p/w500/sEULzxEZvrJvhz91wKxpbih25Sk.jpg','2022-06-16',6.9,0),(21202,'The Man in the Iron Mask','en','Years have passed since the Three Musketeers, Aramis, Athos and Porthos, have fought together with their friend, D\'Artagnan. But with the tyrannical King Louis using his power to wreak havoc in the kingdom while his twin brother, Philippe, remains imprisoned, the Musketeers reunite to abduct Louis and replace him with Philippe.','https://image.tmdb.org/t/p/w500/zHE9yRURvA7DyhYtQxkGTfE1Ywi.jpg','1998-03-12',6.6,0),(21203,'Sweet November','en','Nelson is a man devoted to his advertising career in San Francisco. One day, while taking a driving test at the DMV, he meets Sara. She is very different from the other women in his life. Nelson causes her to miss out on taking the test and later that day she tracks him down. One thing leads to another and Nelson ends up living with her through a November that will change his life forever.','https://image.tmdb.org/t/p/w500/3biEHZSBSYqSkawU2sQyNbLcjgE.jpg','2001-02-16',6.9,0),(21204,'At Eternity\'s Gate','en','Famed but tormented artist Vincent van Gogh spends his final years in Arles, France, painting masterworks of the natural world that surrounds him.','https://image.tmdb.org/t/p/w500/y4LvHQoX5YunHJ2EMBSjQvOkvD9.jpg','2018-11-15',6.9,0),(21205,'Clear and Present Danger','en','CIA Analyst Jack Ryan is drawn into an illegal war fought by the US government against a Colombian drug cartel.','https://image.tmdb.org/t/p/w500/6xTM8FPxrLRYwz6I3fqtwh7xybs.jpg','1994-08-03',6.6,0),(21206,'The Lost Boys','en','A mother and her two teenage sons move to a seemingly nice and quiet small coastal California town yet soon find out that it\'s overrun by bike gangs and vampires. A couple of teenage friends take it upon themselves to hunt down the vampires that they suspect of a few mysterious murders and restore peace and calm to their town.','https://image.tmdb.org/t/p/w500/nH1lvyQvfbL5GKScTtT6zkIvDEn.jpg','1987-07-31',7.1,0),(21207,'American Psycho II: All American Girl','en','Rachel is a criminology student hoping to land a position as a teacher\'s assistant for professor Robert Starkman. She\'s sure this position will pave the way to an FBI career, and she\'s willing to do anything to obtain it -- including killing her classmates. The school psychiatrist, Dr. Daniels, becomes aware that Rachel is insane, but Rachel is skilled at her dangerous game of death and identity theft.','https://image.tmdb.org/t/p/w500/mUkuaPoC21Dtemnx583THBEdHG0.jpg','2002-04-22',4.6,0),(21208,'The Man with the Golden Gun','en','Cool government operative James Bond searches for a stolen invention that can turn the sun\'s heat into a destructive weapon. He soon crosses paths with the menacing Francisco Scaramanga, a hitman so skilled he has a seven-figure working fee. Bond then joins forces with the swimsuit-clad Mary Goodnight, and together they track Scaramanga to a Thai tropical isle hideout where the killer-for-hire lures the slick spy into a deadly maze for a final duel.','https://image.tmdb.org/t/p/w500/zULDLrGE42iTiizMJKDoTGbIKlu.jpg','1974-12-01',6.4,0),(21209,'Goal!','en','Like millions of kids around the world, Santiago harbors the dream of being a professional footballer... However, living in the Barrios section of Los Angeles, he thinks it is only that--a dream. Until one day an extraordinary turn of events has him trying out for Premiership club Newcastle United.','https://image.tmdb.org/t/p/w500/9YZhJGoIbJtrjDYbENGhR6f6SZE.jpg','2005-09-29',6.7,0),(21210,'It Could Happen to You','en','Charlie Lang is a simple, kindhearted New York City cop. When he realizes he has no money to tip waitress Yvonne Biasi, Lang offers her half the winnings of his lottery ticket. Amazingly, the ticket happens to be a winner, in the sum of $4 million. True to his word, Lang proceeds to share the prize money with Biasi, which infuriates his greedy wife, Muriel. Not content with the arrangement, Muriel begins scheming to take all the money.','https://image.tmdb.org/t/p/w500/6UOaeLDOdwwTMQtbl5YL6EGjqy0.jpg','1994-07-29',6.5,0),(21211,'Christmas with You','en','Feeling career burnout, pop star Angelina escapes to grant a young fan\'s wish in small-town New York, where she not only finds the inspiration to revitalize her career but also a shot at true love.','https://image.tmdb.org/t/p/w500/nkJQWyK0ABJaBaQ4Io3kOzMvdsa.jpg','2022-11-17',5.8,0),(21212,'Sheena','en','Sheena\'s parents are killed while on Safari. She is raised by the mystical witch woman of an African tribe. When her foster mother is framed for the murder of a political leader, Sheena and a newsman, Vic Casey, are forced to flee while pursued by the mercenaries hired by the real killer, who hopes to assume power. Sheena\'s ability to talk to the animals and knowledge of jungle lore give them a chance against the high tech weapons of the mercenaries.','https://image.tmdb.org/t/p/w500/eCLoPrB7TKRZnJ38jHvrulR6H65.jpg','1984-08-17',5.8,0),(21213,'A River Runs Through It','en','A River Runs Through is a cinematographically stunning true story of Norman Maclean. The story follows Norman and his brother Paul through the experiences of life and growing up, and how their love of fly fishing keeps them together despite varying life circumstances in the untamed west of Montana in the 1920\'s.','https://image.tmdb.org/t/p/w500/aVP45oS2cBL4WtZ1kB7r8uarruB.jpg','1992-10-09',7,0),(21214,'Wolf Warrior 3','zh','The third movie about a Chinese special force soldier with extraordinary marksmanship.','https://image.tmdb.org/t/p/w500/detm29wsfhS1bz5YdURvDePiUY3.jpg',NULL,0,0),(21215,'Das Boot','de','A German submarine hunts allied ships during the Second World War, but it soon becomes the hunted. The crew tries to survive below the surface, while stretching both the boat and themselves to their limits.','https://image.tmdb.org/t/p/w500/fSI5yoee0mBxwNyCvf8m3B5tFMu.jpg','1981-09-17',8.1,0),(21216,'Arthur & Merlin: Knights of Camelot','en','King Arthur returns home after fighting the Roman Empire. His illegitimate son has corrupted the throne of Camelot and King Arthur must reunite with the wizard Merlin and the Knights of the Round Table to fight to get back his crown.','https://image.tmdb.org/t/p/w500/chGTXsvn53XvEnvsJ9ZD9eiYKx9.jpg','2020-05-28',5.3,0),(21217,'Zero Dark Thirty','en','A chronicle of the decade-long hunt for al-Qaeda terrorist leader Osama bin Laden after the September 2001 attacks, and his death at the hands of the Navy S.E.A.L. Team 6 in May, 2011.','https://image.tmdb.org/t/p/w500/coeTvXKAYZlrcIfsCfYV5Hw1npu.jpg','2012-12-19',7,0),(21218,'Dragon Blade','zh','Huo An, the commander of the Protection Squad of the Western Regions, was framed by evil forces and becomes enslaved. On the other hand, a Roman general escapes to China after rescuing the Prince. The heroic duo meet in the Western Desert and a thrilling story unfolds.','https://image.tmdb.org/t/p/w500/suTAWYLIHAnkH2V4nC8t3AG7HjR.jpg','2015-02-19',6.3,0),(21219,'Run Lola Run','de','Lola receives a phone call from her boyfriend Manni. He lost 100,000 DM in a subway train that belongs to a very bad guy. She has 20 minutes to raise this amount and meet Manni. Otherwise, he will rob a store to get the money. Three different alternatives may happen depending on some minor event along Lola\'s run.','https://image.tmdb.org/t/p/w500/v0giIi4bTILVhNhJajet3WWY3FA.jpg','1998-03-03',7.3,0),(21220,'The Poseidon Adventure','en','When their ocean liner capsizes, a group of passengers struggle to survive and escape.','https://image.tmdb.org/t/p/w500/6RGiA5BfhelU9zoD0b1GAG4GWWf.jpg','1972-12-13',7.1,0),(21221,'Un alibi','fr','A group of friends who have known each other for many years meet at Max and Lucie\'s house to celebrate Lucie\'s birthday. When they arrive, the three guests discover Max kneeling in front of the body of his wife who has been murdered. He is sure that the police will charge him because everything accuses him. Convinced of his innocence, his friends decide to give him an alibi. But the investigation tightens around Max...','https://image.tmdb.org/t/p/w500/wei2WoPJka60ITevLP9f73guSNn.jpg','2022-04-26',6.2,0),(21222,'Mike and Dave Need Wedding Dates','en','Mike and Dave are young, adventurous, fun-loving brothers who tend to get out of control at family gatherings. When their sister Jeanie reveals her Hawaiian wedding plans, the rest of the Stangles insist that the brothers bring respectable dates. After placing an ad on Craigslist, the siblings decide to pick Tatiana and Alice, two charming and seemingly normal women. Once they arrive on the island, however, Mike and Dave realize that their companions are ready to get wild and party.','https://image.tmdb.org/t/p/w500/rK0UwpiE3PSdGahfDZLCummxMwd.jpg','2016-07-07',6.1,0),(21223,'Innerspace','en','Test pilot Tuck Pendleton volunteers to test a special vessel for a miniaturization experiment. Accidentally injected into a neurotic hypochondriac, Jack Putter, Tuck must convince Jack to find his ex-girlfriend, Lydia Maxwell, to help him extract Tuck and his ship and re-enlarge them before his oxygen runs out.','https://image.tmdb.org/t/p/w500/A4azclZQjqeQxXvcok3rdUmuq8a.jpg','1987-06-30',6.8,0),(21224,'A Perfect Getaway','en','For their honeymoon, newlyweds Cliff and Cydney head to the tropical islands of Hawaii. While journeying through the paradisaical countryside the couple encounters Kale and Cleo, two disgruntled hitchhikers and Nick and Gina, two wild but well-meaning spirits who help guide them through the lush jungles. The picturesque waterfalls and scenic mountainsides quickly give way to terror when Cliff and Cydney learn of a grisly murder that occurred nearby and realize that they\'re being followed by chance acquaintances that suspiciously fit the description of the killers.','https://image.tmdb.org/t/p/w500/7Rf1vYvUsZlTG3xlDwsktIrKi7K.jpg','2009-06-08',6.3,0),(21225,'Moulin Rouge!','en','A celebration of love and creative inspiration takes place in the infamous, gaudy and glamorous Parisian nightclub, at the cusp of the 20th century. A young poet, who is plunged into the heady world of Moulin Rouge, begins a passionate affair with the club\'s most notorious and beautiful star.','https://image.tmdb.org/t/p/w500/2kjM5CUZRIU5yOANUowrbJcRL9L.jpg','2001-05-24',7.6,0),(21226,'Overboard','en','Heiress Joanna Stayton hires carpenter Dean Proffitt to build a closet on her yacht—and refuses to pay him for the project when it\'s done. But after Joanna accidentally falls overboard and loses her memory, Dean sees an opportunity to get even.','https://image.tmdb.org/t/p/w500/v9MVFgUTvNRXmm2WWOzST6UXb5x.jpg','1987-12-16',6.8,0),(21227,'Blade Runner: Black Out 2022','en','This animated short revolves around the events causing an electrical systems failure on the west coast of the US. According to Blade Runner 2049’s official timeline, this failure leads to cities shutting down, financial and trade markets being thrown into chaos, and food supplies dwindling. There’s no proof as to what caused the blackouts, but Replicants — the bio-engineered robots featured in the original Blade Runner, are blamed.','https://image.tmdb.org/t/p/w500/zzRjnUOVXyjp2WudgT7KxJLYh9D.jpg','2017-09-26',7.2,0),(21228,'The Mad Women\'s Ball','fr','Eugenie has a unique gift: she hears and sees the dead. When her family discovers her secret, at the end of the 19th century, she is taken by her father and brother to the neurological clinic at La Pitié Salpêtrière with no possibility of escaping her fate. Her destiny becomes entwined with that of Geneviève, a nurse at the hospital.','https://image.tmdb.org/t/p/w500/A8KeSPmFDxqHKwNzyiuwUvPIrw0.jpg','2021-09-12',7.1,0),(21229,'Red Bull Dragon Ball FighterZ World Final Paris','pt','','https://image.tmdb.org/t/p/w500/kRofvR2SwUpTw3H0h2NmL5d1iWc.jpg','0000-00-00',0,0),(21230,'Cyrano','en','A man ahead of his time, Cyrano de Bergerac dazzles whether with ferocious wordplay at a verbal joust or with brilliant swordplay in a duel. But, convinced that his appearance renders him unworthy of the love of a devoted friend, the luminous Roxanne, Cyrano has yet to declare his feelings for her—and Roxanne has fallen in love, at first sight, with Christian.','https://image.tmdb.org/t/p/w500/e4koV8iC2cCM57bqUnEnIL2a2zH.jpg','2021-12-17',6.5,0),(21231,'Sabotaje','es','','https://image.tmdb.org/t/p/w500/c2npw8mLtSxZzFCbV7Ob7oVGD4W.jpg','2016-12-31',5.5,0),(21232,'Milf','en','A group of nerdy college guys who can\'t seem to connect with girls their own age discover the excitement of hooking up with sexy older women.','https://image.tmdb.org/t/p/w500/2iciKTqt0ioOh6TFaXXVUqKPVj9.jpg','2010-10-17',4.7,0),(21233,'Invasion of the Body Snatchers','en','Matthew Bennell notices that several of his friends are complaining that their close relatives are in some way different. When questioned later they themselves seem changed, as they deny everything or make lame excuses. As the invaders increase in number they become more open and Bennell, who has by now witnessed an attempted \'replacement\', realises that he and his friends must escape or suffer the same fate.','https://image.tmdb.org/t/p/w500/5oNHdVo0vTsaC47Jv2Wb4eeo4V4.jpg','1978-12-19',7.2,0),(21234,'Nosferatu the Vampyre','de','Jonathan Harker, a real estate agent, goes to Transylvania to visit the mysterious Count Dracula and formalize the purchase of a property in Wismar. Once Jonathan is caught under his evil spell, Dracula travels to Wismar where he meets the beautiful Lucy, Jonathan\'s wife, while a plague spreads through the town, now ruled by death.','https://image.tmdb.org/t/p/w500/g7fEH8uafDHYDHOafRPkoud0Tjy.jpg','1979-01-17',7.4,0),(21235,'Beau Pere','fr','Rémi is a man trapped in a deteriorating marriage. When his wife is unexpectedly killed in a car accident, Rémi is left with his stepdaughter, Marion, who chooses to stay with him rather than live with her birth father. After the initial shock passes, Rémi is caught off-guard when Marion begins expressing her attraction to him. Initially repulsed, Marion\'s mature beauty wears him down as he finally caves to her seductions.','https://image.tmdb.org/t/p/w500/hzGFiFY8wYeqxM8T4O4HFmXTqca.jpg','1981-09-15',6.6,0),(21236,'Fighting with My Family','en','Born into a tight-knit wrestling family, Paige and her brother Zak are ecstatic when they get the once-in-a-lifetime opportunity to try out for the WWE. But when only Paige earns a spot in the competitive training program, she must leave her loved ones behind and face this new cutthroat world alone. Paige\'s journey pushes her to dig deep and ultimately prove to the world that what makes her different is the very thing that can make her a star.','https://image.tmdb.org/t/p/w500/cVhe15rJLRjolunSWLBN6xQLyGU.jpg','2019-02-14',6.9,0),(21237,'Wild Indian','en','Decades after covering up his classmate’s murder, Michael has moved on from his reservation and fractured past. When a man who shares his violent secret seeks vengeance, Michael goes to great lengths to protect his new life with his wife and boss from the demons of his past.','https://image.tmdb.org/t/p/w500/yhOpkNvgW1ZzmEpR4iqxKwKKShL.jpg','2021-09-03',5.7,0),(21238,'El Dorado','en','Cole Thornton, a gunfighter for hire, joins forces with an old friend, Sheriff J.P. Hara. Together with a fighter and a gambler, they help a rancher and his family fight a rival rancher that is trying to steal their water.','https://image.tmdb.org/t/p/w500/poJxkMtTA3E95lJ6RnBgNxF0Vmx.jpg','1966-12-17',7.4,0),(21239,'How High','en','Multi-platinum rap superstars Redman and Method Man star as Jamal and Silas, two regular guys who smoke something magical, ace their college entrance exams and wind up at Harvard. Ivy League ways are strange but Silas and Jamal take it in a stride -- until their supply of supernatural smoke runs dry. That\'s when they have to start living by their wits and rely on their natural resources to make the grade.','https://image.tmdb.org/t/p/w500/x6NMlhvk3fgfXhHLz19h0I9Hl0q.jpg','2001-12-21',6.3,0),(21240,'Escape from Pretoria','en','South Africa, 1978. Tim Jenkin and Stephen Lee, two white political activists from the African National Congress imprisoned by the apartheid regime, put a plan in motion to escape from the infamous Pretoria Prison.','https://image.tmdb.org/t/p/w500/5vePsmbekQ1ysXS6f0lhzgCwvc4.jpg','2020-03-06',7.3,0),(21241,'Son of a Gun','en','Locked up for a minor crime, 19 year old JR quickly learns the harsh realities of prison life. Protection, if you can get it, is paramount. JR soon finds himself under the watchful eye of Australia\'s most notorious criminal, Brendan Lynch, but protection comes at a price.','https://image.tmdb.org/t/p/w500/yRLVyhQfkW2hn15e8NIqarswLAr.jpg','2014-10-16',6.4,0),(21242,'Dhamaka','hi','When a cynical ex-TV news anchor gets an alarming call on his radio show, he sees a chance for a career comeback — but it may cost his conscience.','https://image.tmdb.org/t/p/w500/KowKEuyWziUtnCYicv6zhzTQIv.jpg','2021-11-19',7.1,0),(21243,'The Snitch Cartel','es','The real life story of Andres Lopez Lopez aka \"Frecita\" during his years involved with the Colombian Cartel aka \"Cartel Norte del Valle\"','https://image.tmdb.org/t/p/w500/9SquCdPFzW2TFnuvrXOcabFW05b.jpg','2011-11-11',7.1,0),(21244,'The Incredibly Strange Creatures Who Stopped Living and Became Mixed-Up Zombies!!?','en','Jerry, his girlfriend Angela, and their friend Harold take a trip to a local seaside carnival, but when the carnival\'s fortune teller, Madame Estrella, predicts death for someone close to Angela, strange things begin to happen.','https://image.tmdb.org/t/p/w500/vfXLgQk5s1bzQfWV1LnS8Ch1Sbi.jpg','1964-02-10',2.5,0),(21245,'The Card Counter','en','William Tell just wants to play cards. His spartan existence on the casino trail is shattered when he is approached by Cirk, a vulnerable and angry young man seeking help to execute his plan for revenge on a military colonel. Tell sees a chance at redemption through his relationship with Cirk. But keeping Cirk on the straight-and-narrow proves impossible, dragging Tell back into the darkness of his past.','https://image.tmdb.org/t/p/w500/y5DNLVg0gPiGSkuK4yFc4fjQ42Q.jpg','2021-09-03',6.2,0),(21246,'Sweet Home Alabama','en','New York fashion designer, Melanie Carmichael suddenly finds herself engaged to the city\'s most eligible bachelor. But her past holds many secrets—including Jake, the redneck husband she married in high school, who refuses to divorce her. Bound and determined to end their contentious relationship once and for all, Melanie sneaks back home to Alabama to confront her past.','https://image.tmdb.org/t/p/w500/698cbxq0SRwCdOPG5Bwi7JDk12d.jpg','2002-09-26',6.4,0),(21247,'Apollo 13','en','The true story of technical troubles that scuttle the Apollo 13 lunar mission in 1970, risking the lives of astronaut Jim Lovell and his crew, with the failed journey turning into a thrilling saga of heroism. Drifting more than 200,000 miles from Earth, the astronauts work furiously with the ground crew to avert tragedy.','https://image.tmdb.org/t/p/w500/oYUZHYMwNKnE1ef4WE5Hw2a9OAY.jpg','1995-06-30',7.4,0),(21248,'Without Saying Goodbye','es','The opposite lives of a workaholic architect and a fiery artist are upended when their chance encounter in breathtaking Peru shifts their views on life.','https://image.tmdb.org/t/p/w500/11SOeFmUEHahuyMOxxT1wdJ3iJs.jpg','2022-03-18',7.3,0),(21249,'To Leslie','en','A West Texas single mother wins the lottery and squanders it just as fast, leaving behind a world of heartbreak. Years later, with her charm running out and nowhere to go, she fights to rebuild her life and find redemption.','https://image.tmdb.org/t/p/w500/bFTgfsw4cnNjIZZ2r6P363X2Uk3.jpg','2022-10-07',7.3,0),(21250,'The Brothers Grimm','en','Folklore collectors and con artists, Jake and Will Grimm, travel from village to village pretending to protect townsfolk from enchanted creatures and performing exorcisms. However, they are put to the test  when they encounter a real magical curse in a haunted forest with real magical beings, requiring genuine courage.','https://image.tmdb.org/t/p/w500/v6J7QGCSrtvwvqAt6783BbO3h61.jpg','2005-08-26',5.8,0),(21251,'Ted Bundy: American Boogeyman','en','Set in a gritty and decadent 1970s America, American Boogeyman follows the elusive and charming killer and the manhunt that brought him to justice involving the detective and the FBI rookie who coined the phrase ‘serial killer’.','https://image.tmdb.org/t/p/w500/1MGcMWgxYPFrBMjIAHcQqmsOIGS.jpg','2021-08-16',7.2,0),(21252,'The Ghost of Lord Farquaad','en','Lord Farquaad was eaten by the dragon, but his ghost has returned, and he\'s still evil. With the help of his henchman, Thelonious, he kidnaps Fiona. Shrek and the donkey set out to save her, with help from the dragon, before she goes over a waterfall on a raft.','https://image.tmdb.org/t/p/w500/6yyGjJ0Og9LrM9XQ35quIhZpZiQ.jpg','2003-05-23',6,0),(21253,'The Invasion','en','Washington, D.C. psychologist Carol Bennell and her colleague Dr. Ben Driscoll are the only two people on Earth who are aware of an epidemic running rampant through the city. They discover an alien virus aboard a crashed space shuttle that transforms anyone who comes into contact with it into unfeeling drones while they sleep. Carol realizes her son holds the key to stopping the spread of the plague and she races to find him before it is too late.','https://image.tmdb.org/t/p/w500/69yA6E7JOKJSfK8JMAOsieCDB8A.jpg','2007-08-17',6,0),(21254,'Hellbound: Hellraiser II','en','Doctor Channard is sent a new patient, a girl warning of the terrible creatures that have destroyed her family, Cenobites who offer the most intense sensations of pleasure and pain. But Channard has been searching for the doorway to Hell for years, and Kirsty must follow him to save her father and witness the power struggles among the newly damned.','https://image.tmdb.org/t/p/w500/nQHXjLcnSy9EIjRFoqKm0WCyaFv.jpg','1988-12-23',6.4,0),(21255,'Angus, Thongs and Perfect Snogging','en','Georgia Nicolson is fourteen, lives with nosey parents who don\'t understand her, an annoying three year old sister and has to wear a beret to school. She would, however, rather be blonde, have a smaller nose and a boyfriend. Revolving around her hilarious journal entries, prepare to be engulfed in the world of the soaring joys and bottomless angst of being a teenager.','https://image.tmdb.org/t/p/w500/3WLMr49X84qGiFn1pkCyhS5SEBZ.jpg','2008-07-25',6.4,0),(21256,'Jan Dara: The Finale','th','Jan Dara returns to Bangkok to take revenge against Wisnan, the man who has made his life a living hell. The fire of vengeance consumes him to such an extent that he’s becoming the man he hated all his life. Jan continues his descent into the dark side. He wants to see those who wronged him suffer.','https://image.tmdb.org/t/p/w500/mm4lssuJy025HTnMmxS1jTNBGlZ.jpg','2013-02-07',5.5,0),(21257,'Julia X','en','Meeting a man on the Internet, Julia decides to see him in person, only to get abducted and branded with the letter \"x\" by that guy. A game of cat and mouse follows, but the story has an unexpected twist.','https://image.tmdb.org/t/p/w500/z8OrB7nM2HBAz7IQ3s8PQlKFDr2.jpg','2011-09-24',5.1,0),(21258,'The Big Trip','ru','A goofy stork mistakenly delivers a baby panda to the wrong door. A bear, a moose, a tiger and a rabbit set on an arduous but fun-filled adventure through the wilderness to return the panda to its rightful home.','https://image.tmdb.org/t/p/w500/31a41CbwpsG9jRrWifmte4nNJWe.jpg','2019-04-27',7,0),(21259,'The Legend of La Llorona','en','While vacationing in Mexico, a couple discovers their son\'s disappearance is tied to a supernatural curse.','https://image.tmdb.org/t/p/w500/wtgEJKEOLnyQkWemEdFa5W8Q29L.jpg','2022-01-07',4.7,0),(21260,'Big','en','When a young boy makes a wish at a carnival machine to be big—he wakes up the following morning to find that it has been granted and his body has grown older overnight. But he is still the same 13-year-old boy inside. Now he must learn how to cope with the unfamiliar world of grown-ups including getting a job and having his first romantic encounter with a woman.','https://image.tmdb.org/t/p/w500/eWhCDJiwxvx3YXkAFRiHjimnF0j.jpg','1988-06-03',7.1,0),(21261,'Speed Racer','en','Speed Racer is the tale of a young and brilliant racing driver. When corruption in the racing leagues costs his brother his life, he must team up with the police and the mysterious Racer X to bring an end to the corruption and criminal activities. Inspired by the cartoon series.','https://image.tmdb.org/t/p/w500/x800OyHuJ9JDuhHLtdPLkH1vBjw.jpg','2008-05-07',6.2,0),(21262,'Beasts of No Nation','en','Based on the experiences of Agu, a child fighting in the civil war of an unnamed, fictional West African country. Follows Agu\'s journey as he\'s forced to join a group of soldiers. While he fears his commander and many of the men around him, his fledgling childhood has been brutally shattered by the war raging through his country, and he is at first torn between conflicting revulsion and fascination.','https://image.tmdb.org/t/p/w500/1D4vcJmJc58WXarpRtwgd2do9Rg.jpg','2015-09-11',7.6,0),(21263,'F*ck Love Too','nl','In this romantic comedy, several friends, each dealing with unhappy love lives, turn to each other for help - but not always with the best results.','https://image.tmdb.org/t/p/w500/u71tsZpPsIK9kTXbxHtSbNr6oSd.jpg','2022-05-20',5.5,0),(21264,'The Christmas Chronicles','en','Siblings Kate and Teddy try to prove Santa Claus is real, but when they accidentally cause his sleigh to crash, they have to save Christmas.','https://image.tmdb.org/t/p/w500/5Il2EMSF2KecrUKZPuen6BZmaCP.jpg','2018-11-22',7.2,0),(21265,'Bulletproof Monk','en','A mysterious and immortal Tibetan kung fu master, who has spent the last 60 years traveling around the world protecting the ancient Scroll of the Ultimate, mentors a selfish street kid in the ancient intricacies of kung fu.','https://image.tmdb.org/t/p/w500/kHWv16c4uDmiEujICSBdQ52TH55.jpg','2003-03-28',5.5,0),(21266,'Dangerous Minds','en','Former Marine Louanne Johnson lands a gig teaching in a pilot program for bright but underachieving teens at a notorious inner-city high school. After having a terrible first day, she decides she must throw decorum to the wind. When Johnson returns to the classroom, she does so armed with a no-nonsense attitude informed by her military training and a fearless determination to better the lives of her students -- no matter what the cost.','https://image.tmdb.org/t/p/w500/yWHWC8fJRp2kLgiFrEa8o3krOH9.jpg','1995-08-11',7,0),(21267,'Old Henry','en','A widowed farmer and his son warily take in a mysterious, injured man with a satchel of cash. When a posse of men claiming to be the law come for the money, the farmer must decide who to trust. Defending a siege of his homestead, the farmer reveals a talent for gun-slinging that surprises everyone calling his true identity into question.','https://image.tmdb.org/t/p/w500/eE1SL0QoDsvAMqQly56IkRtlN1W.jpg','2021-10-01',7.3,0),(21268,'18 Year Old Virgin','en','In a series of sexual mishaps, a high school senior tries to lose her virginity on the last night before graduation.','https://image.tmdb.org/t/p/w500/xWMNDjRSKAzrQM9FBBdJoSX8DFG.jpg','2009-01-20',4,0),(21269,'Sex and the Emperor','cn','In the Qing Dynasty, the only people who lived in the Forbidden City are the Emperor\'s concubines, their maids, the eunuchs and the Emperor himself. Li Lianying is an eunuch who enters the Forbidden City with a big secret. One that will have his head on the floor if the wrong people find out.','https://image.tmdb.org/t/p/w500/9ormMpTstp3J0EWrUJ9Ql1ecrYe.jpg','1994-02-10',3.7,0),(21270,'I Won\'t Let You Go','en','Angela West has always wanted a family, and now has one with her husband Keith. When an ex-boyfriend starts stalking her, Angela turns to Keith, but no matter what she tries, she can\'t seem to shake the stalker who is ruining her life.','https://image.tmdb.org/t/p/w500/9JMCwvWCV8aoHd7ARk8zGJouXIG.jpg','2022-06-23',5.3,0),(21271,'Behind Enemy Lines','en','While flying a routine reconnaissance mission over Bosnia, fighter pilot Chris Burnett photographs something he wasn\'t supposed to see and gets shot down behind enemy lines, where he must outrun an army led by a ruthless Serbian general. With time running out and a deadly tracker on his trail, Burnett\'s commanding officer decides to risk his career and launch a renegade rescue mission to save his life.','https://image.tmdb.org/t/p/w500/fZReMWU3zszvaktDUqOoWCzHssZ.jpg','2001-11-30',6.3,0),(21272,'Elephant','en','Several ordinary high school students go through their daily routine as two others prepare for something more malevolent.','https://image.tmdb.org/t/p/w500/1a4VU9z2hxEvugHMK7VsobB9xTX.jpg','2003-09-20',7.1,0),(21273,'Castle Freak','en','After she’s permanently blinded in a tragic car accident, Rebecca receives some bizarre news: her long-lost mother has recently passed away, leaving her their family’s ancestral castle in rural Albania. Traveling to the estate with a group of friends, Rebecca hopes it will be an opportunity for her to reconnect with a past she never knew and a mother who seemingly left her behind. When mysterious events begin to occur and her friends begin to die, Rebecca must unravel the secrets of her family’s history before she too falls prey to the Castle Freak.','https://image.tmdb.org/t/p/w500/HJEosQRIdBzAHEdZJCUF7e5FmF.jpg','2020-12-04',4.6,0),(21274,'sex, lies, and videotape','en','A sexually repressed woman\'s husband is having an affair with her sister. The arrival of a visitor with a rather unusual fetish changes everything.','https://image.tmdb.org/t/p/w500/cVjx7si5DsRRdU2qUp90qSUUiRm.jpg','1989-08-04',6.9,0),(21275,'The Bank Job','en','Terry is a small-time car dealer trying to leave his shady past behind and start a family. Martine is a beautiful model from Terry\'s old neighbourhood who knows that Terry is no angel. When Martine proposes a foolproof plan to rob a bank, Terry recognises the danger but realises this may be the opportunity of a lifetime. As the resourceful band of thieves burrows its way into a safe-deposit vault at a Lloyds Bank, they quickly realise that, besides millions in riches, the boxes also contain secrets that implicate everyone from London\'s most notorious underworld gangsters to powerful government figures, and even the Royal Family. Although the heist makes headlines throughout Britain for several days, a government gag order eventually brings all reporting of the case to an immediate halt.','https://image.tmdb.org/t/p/w500/ayrGDJDsSBczjztGUWKqmzL97xg.jpg','2008-02-28',6.8,0),(21276,'Masters of the Universe','en','The world of Eternia in the aftermath of Skeletor\'s war on Castle Grayskull, which he has won after seizing Grayskull and the surrounding city using a cosmic key developed by the locksmith Gwildor. The Sorceress is now Skeletor\'s prisoner and he begins to drain her life-force as he waits for the moon of Eternia to align with the Great Eye of the Universe that will bestow god-like power upon him.','https://image.tmdb.org/t/p/w500/gaUecXFd31V68yOTJPJYaB9YhAf.jpg','1987-08-07',5.7,0),(21277,'The Cobbler','en','Max Simkin repairs shoes in the same New York shop that has been in his family for generations. Disenchanted with the grind of daily life, Max stumbles upon a magical heirloom that allows him to step into the lives of his customers and see the world in a new way. Sometimes walking in another man\'s shoes is the only way one can discover who they really are.','https://image.tmdb.org/t/p/w500/iQaJB6upTmR4gL8xmytE5atKWFP.jpg','2014-09-11',5.8,0),(21278,'Black Water','en','A deep cover operative awakens to find himself imprisoned on a submarine. With the help of a fellow prisoner and an amateur agent, he must race against the clock to escape the vessel and expose who set him up.','https://image.tmdb.org/t/p/w500/tIcZAB5AmRN8fIDXfDZ2aUok9qa.jpg','2018-05-18',5.7,0),(21279,'Stowaway','en','A three-person crew on a mission to Mars faces an impossible choice when an unplanned passenger jeopardizes the lives of everyone on board.','https://image.tmdb.org/t/p/w500/yOscLK7KzEPDdi1P8RmevGIjOSp.jpg','2021-06-24',5.9,0),(21280,'The Princess Switch: Switched Again','en','When Duchess Margaret unexpectedly inherits the throne & hits a rough patch with Kevin, it’s up to Stacy to save the day before a new lookalike — party girl Fiona — foils their plans.','https://image.tmdb.org/t/p/w500/e4qXQXXaVYvHBE3Rx5x3qrmxorB.jpg','2020-11-19',6.9,0),(21281,'Battle for the Planet of the Apes','en','The fifth and final episode in the Planet of the Apes series. After the collapse of human civilization, a community of intelligent apes led by Caesar lives in harmony with a group of humans. Gorilla General Aldo tries to cause an ape civil war and a community of human mutants who live beneath a destroyed city try to conquer those whom they perceive as enemies. All leading to the finale.','https://image.tmdb.org/t/p/w500/dP5dYjLp5p2CG103cJMio4Nj29d.jpg','1973-06-15',5.7,0),(21282,'Marvel Studios Assembled: The Making of She-Hulk: Attorney at Law','en','Join the likes of Tatiana Maslany, Mark Ruffalo, Tim Roth, and Benedict Wong as they reveal how Marvel Studios’ She-Hulk: Attorney at Law was conceived and shaped. Discover what it took for She-Hulk’s creators to pull off the show’s tricky tone and deliver Marvel Studios’ first truly comedic series – one that boldly breaks the fourth wall to acknowledge its own audience, no less!','https://image.tmdb.org/t/p/w500/yhFN7yvskzm1Tsknkg46eQbQr9w.jpg','2022-11-03',7,0),(21283,'She Will','en','Veronica, an aging film star, retreats to the Scottish countryside with her nurse Desi to recover from  a double mastectomy. While there, mysterious forces give Veronica the power to enact revenge within her dreams.','https://image.tmdb.org/t/p/w500/cbN1YWgBmwqGzqF6ZTsM96dub4r.jpg','2022-07-15',5.6,0),(21284,'Dragon Nest: Warriors\' Dawn','zh','For years, the land of Altera has observed an uneasy peace between the humans, the elves, and the beasts who are loyal to the legendary Black Dragon. But when the dragon wakes from its hibernation, mobilizing a force of beasts to make war, a small band of humans and elves unite in a search for the secret road to the dragon’s lair.','https://image.tmdb.org/t/p/w500/8fklM49dK7AZ3j8jgycxbRwECGa.jpg','2014-05-20',7.7,0),(21285,'The Marvels','en','Carol Danvers, Monica Rambeau, and Kamala Khan trade places with each other every time they use their powers and must team up to fix their problem.','https://image.tmdb.org/t/p/w500/bnz17wOkp9O0c9JADOncEx0Q1sJ.jpg','2023-07-26',0,0),(21286,'Monster High: 13 Wishes','en','It’s a new school year at Monster High™, and the little sister of Clawdeen Wolf™, Howleen, is determined to be more fangtastic than ever.  Her dream of popularity turns out to be easier than anyone imagined when she stumbles upon a genie named Gigi Grant™ who grants her not 3, but 13 Wishes!  But the ghouls quickly learn to be s-careful what you wish for because each wish comes with a dark side, and soon the student disem-body of Monster High™ is turned upside-down!  Join Frankie Stein™, Clawdeen Wolf™, Draculaura™ and the rest of their creeperiffic ghoulfriends as they journey deep inside the magic lantern to save the very soul of Monster High™… while flashing their killer style every step of the way!','https://image.tmdb.org/t/p/w500/iYcB72K3dTn4xNIRWxUeyrLLpN.jpg','2013-10-08',7.5,0),(21287,'The Rebound','en','Upon discovering her husband\'s infidelity, Sandy leaves the suburbs and moves into the city. There, she befriends Aram, a guy whose wife only married him so she could get a green card. Sandy hires Aram to be her nanny, and  it isn\'t long until Aram and Sandy find out they get along wonderfully and start to date. But is their relationship real or is it, in fact, just a rebound for both of them?','https://image.tmdb.org/t/p/w500/pnr4sA9tn3E5Sc2qHbG3yT4m8Fv.jpg','2009-09-16',6.5,0),(21288,'Citizen Kane','en','Newspaper magnate, Charles Foster Kane is taken from his mother as a boy and made the ward of a rich industrialist. As a result, every well-meaning, tyrannical or self-destructive move he makes for the rest of his life appears in some way to be a reaction to that deeply wounding event.','https://image.tmdb.org/t/p/w500/sav0jxhqiH0bPr2vZFU0Kjt2nZL.jpg','1941-04-17',8,0),(21289,'The Sound of Music','en','In the years before the Second World War, a tomboyish postulant at an Austrian abbey is hired as a governess in the home of a widowed naval captain with seven children, and brings a new love of life and music into the home.','https://image.tmdb.org/t/p/w500/xvXiJggaxRrU4jLjTXCmqnqEsGd.jpg','1965-03-29',7.7,0),(21290,'Emergency','en','Ready for a night of legendary partying, three college students must weigh the pros and cons of calling the police when faced with an unexpected situation.','https://image.tmdb.org/t/p/w500/b1OVtVtcC7KQlsueXCwBSRaAR1o.jpg','2022-05-20',6.1,0),(21291,'Next','en','Las Vegas showroom magician Cris Johnson has a secret which torments him: he can see a few minutes into the future. Sick of the examinations he underwent as a child and the interest of the government and medical establishment in his power, he lies low under an assumed name in Vegas, performing cheap tricks and living off small-time gambling \"winnings.\" But when a terrorist group threatens to detonate a nuclear device in Los Angeles, government agent Callie Ferris must use all her wiles to capture Cris and convince him to help her stop the cataclysm.','https://image.tmdb.org/t/p/w500/td5uOBW41ib1KGz3g1Kc33BdFyj.jpg','2007-04-25',6,0),(21292,'Recep İvedik 7','tr','Recep and Nurullah decide to go village house, which is inherited from his grandma. Recep finds out the existence of a big project, that will damage the village and the surrounding forests. Villagers will fight against the project with Recep\'s leadership.','https://image.tmdb.org/t/p/w500/cTTo0PlRBzupo3zj8EoJXzYnj1i.jpg','2022-12-09',7,0),(21293,'Things Heard & Seen','en','Catherine Clare reluctantly trades life in 1980 Manhattan for a remote home in the tiny hamlet of Chosen, New York, after her husband George lands a job teaching art history at a small Hudson Valley college. Even as she does her best to transform the old dairy farm into a place where young daughter Franny will be happy, Catherine increasingly finds herself isolated and alone. She soon comes to sense a sinister darkness lurking both in the walls of the ramshackle property—and in her marriage to George.','https://image.tmdb.org/t/p/w500/9tSkNmGt1K5Lgf0L0BTHHYJNz0W.jpg','2021-04-29',5.8,0),(21294,'Independence Daysaster','en','When Earth is attacked by a hostile alien force, a small town firefighter and a rogue SETI scientist team up to activate the only technology capable of defeating the invaders.','https://image.tmdb.org/t/p/w500/6jor0EqECPgHqu89GrQIy9Wetkf.jpg','2013-06-27',4.6,0),(21295,'The Swimming Pool','fr','Set in a magnificent villa near a sun-drenched St. Tropez, lovers Jean-Paul and Marianne are spending a happy, lazy summer holiday. Their only concern is to gratify their mutual passion - until the day when Marianne invites her former lover and his beautiful teenage daughter to spend a few days with them. From the first moment, a certain uneasiness and tension begin to develop between the four, which soon escalates in a dangerous love-game.','https://image.tmdb.org/t/p/w500/7KQOEJ0LV6umRVM9xTRSmGSfvVJ.jpg','1969-01-31',7,0),(21296,'Bank Robbers: The Last Great Heist','es','Through candid interviews, the perpetrators of Argentina\'s most notorious bank heist detail how — and why — they carried out the radical 2006 operation.','https://image.tmdb.org/t/p/w500/1qkIyRyXsrXaear1OdJd0QWaAkC.jpg','2022-08-10',6.9,0),(21297,'Mary Queen of Scots','en','In 1561, Mary Stuart, widow of the King of France, returns to Scotland, reclaims her rightful throne and menaces the future of Queen Elizabeth I as ruler of England, because she has a legitimate claim to the English throne. Betrayals, rebellions, conspiracies and their own life choices imperil both Queens. They experience the bitter cost of power, until their tragic fate is finally fulfilled.','https://image.tmdb.org/t/p/w500/b5RMzLAyq5QW6GtN9sIeAEMLlBI.jpg','2018-12-07',6.6,0),(21298,'An Extremely Goofy Movie','en','It\'s all extreme sports and a life of freedom as Max sets off for college -- but Goofy misses Max so much he loses his job and goes to finish college alongside Max and his friends. But as Goofy tries to get closer to Max, both must go to the extreme to learn how to live their own lives together.','https://image.tmdb.org/t/p/w500/qr5Q3S7HC16XHQBqE4ZsJJvgUDU.jpg','2000-02-29',6.4,0),(21299,'A Christmas Story Christmas','en','Ralphie is now all grown up and must deal with Christmas and all that comes with it…as a dad.','https://image.tmdb.org/t/p/w500/5QeoDiiIFY9VF87Rm79WpCFZbwf.jpg','2022-11-17',6.6,0),(21300,'Stitch! The Movie','en','The continuing adventures of Lilo, a little Hawaiian girl, and Stitch, the galaxy\'s most-wanted extraterrestrial. Stitch, Pleakley, and Dr. Jumba are all part of the household now, but what Lilo and Stitch don\'t know is that Dr. Jumba brought his other alien \"experiments\" to Hawaiʻi as well.','https://image.tmdb.org/t/p/w500/cBvmxtDDlnBbPkLdQyJwbxdhjqk.jpg','2003-08-26',6.5,0),(21301,'Monster','en','An emotionally scarred highway drifter shoots a sadistic trick who rapes her, and ultimately becomes the United States\' first female serial killer.','https://image.tmdb.org/t/p/w500/aevmNtJCNG4ZlfEeEGZ79frMUes.jpg','2003-12-24',7.2,0),(21302,'Hold the Dark','en','In the grim Alaskan winter, a naturalist hunts for wolves blamed for killing a local boy, but he soon finds himself swept into a chilling mystery.','https://image.tmdb.org/t/p/w500/1etEySwZQnBJpzgplgadPi5y4PL.jpg','2018-09-22',5.3,0),(21303,'A Prayer Before Dawn','en','The amazing true story of Billy Moore, an English boxer incarcerated in Thailand’s most notorious prison. Thrown into a world of drugs and violence, he finds his best chance to escape is to fight his way out in prison Muay Thai tournaments.','https://image.tmdb.org/t/p/w500/qgdOZEnEqnbroqHoslGJSFSKl9R.jpg','2018-05-24',6.8,0),(21304,'Errementari: The Blacksmith and the Devil','eu','Basque Country, Spain, 1843. A police constable arrives at a small village in Álava to investigate a mysterious blacksmith who lives alone deep in the woods.','https://image.tmdb.org/t/p/w500/ltpi1uLkvx2BKHWwbpMjqdAtdHn.jpg','2018-03-02',6.4,0),(21305,'Hero','zh','One man defeated three assassins who sought to murder the most powerful warlord in pre-unified China.','https://image.tmdb.org/t/p/w500/1NBtOH3KPU9UUp1vzVHJ8qzdW88.jpg','2002-07-22',7.5,0),(21306,'Marauders','en','An untraceable group of elite bank robbers is chased by a suicidal FBI agent who uncovers a deeper purpose behind the robbery-homicides.','https://image.tmdb.org/t/p/w500/bAvmDn5C7arBoRrfaG3b3Kdue1q.jpg','2016-07-01',5.8,0),(21307,'Crimson Rivers II: Angels of the Apocalypse','fr','No one is safe when seemingly random killings emerge as a deadly pattern intended to usher in the end of the world.  A murder victim with the same DNA as Christ. A serial killer mimicking the deaths of the 12 Apostles. Inspector Niemans and a young, rebellious detective team up with a beautiful expert in religion to crack the case before their elusive suspect completes the cycle of terror, paving the way to an even bigger bloody catastrophe.','https://image.tmdb.org/t/p/w500/hvQZKLVzW3cYfR5bjgGTGZuCuHs.jpg','2004-02-18',6.1,0),(21308,'Pineapple Express','en','A stoner and his dealer are forced to go on the run from the police after the pothead witnesses a cop commit a murder.','https://image.tmdb.org/t/p/w500/6E50WjeOYjDZg9HXgPjYdGtY2jG.jpg','2008-08-06',6.6,0),(21309,'Climax','fr','Young dancers gather in a remote and empty school building to rehearse on a cold and wintry night. The all-night celebration soon turns into a hallucinatory nightmare when they learn that their sangria is laced with LSD.','https://image.tmdb.org/t/p/w500/47IXH2iEWwX0F7vIyGXaKQ0psBG.jpg','2018-09-19',7.1,0),(21310,'The Adjustment Bureau','en','A man glimpses the future Fate has planned for him – and chooses to fight for his own destiny. Battling the powerful Adjustment Bureau across, under and through the streets of New York, he risks his destined greatness to be with the only woman he\'s ever loved.','https://image.tmdb.org/t/p/w500/A4wKf04g4DCVAWC67uPGozIJPGw.jpg','2011-03-03',6.7,0),(21311,'Stalingrad','de','\"Stalingrad\" follows the progress of a German Platoon through the brutal fighting of the Battle of Stalingrad. After having half their number wiped out and after being placed under the command of a sadistic Captain, the Lieutenant of the platoon leads his men to desert. The men of the platoon attempt to escape from the city which is now surrounded by the Soviet Army.','https://image.tmdb.org/t/p/w500/rB78VDAOK94KJWp9ofgE3GSQEor.jpg','1993-01-20',7.3,0),(21312,'Animal Kingdom: Let\'s Go Ape','fr','Based on the novel \'Evolution Man\' by Roy Lewis, this tells the story about the first man - young Edward - to descend from apes. Edward is ejected by his tribe, but is very resourceful. He learns to walk, discovers fire, manages to hunt - and we follow him as he evolves. He has a generous nature, and search for true humanity - a world where we don\'t eat our fathers.','https://image.tmdb.org/t/p/w500/7qccdwXUMazLqkMKm4ZJ7lAnzUF.jpg','2015-04-08',5.2,0),(21313,'27 Dresses','en','Altruistic Jane finds herself facing her worst nightmare as her younger sister announces her engagement to the man Jane secretly adores.','https://image.tmdb.org/t/p/w500/l8XkZAkrmFpxHr7oRoFoDutUtsZ.jpg','2008-01-10',6.4,0),(21314,'Peter Rabbit','en','Peter Rabbit\'s feud with Mr. McGregor escalates to greater heights than ever before as they rival for the affections of the warm-hearted animal lover who lives next door.','https://image.tmdb.org/t/p/w500/cBWtdp8mgce4QQkH697LpaL0Iik.jpg','2018-02-07',6.7,0),(21315,'Hidalgo','en','Set in 1890, this is the story of a Pony Express courier who travels to Arabia to compete with his horse, Hidalgo, in a dangerous race for a massive contest prize, in an adventure that sends the pair around the world...','https://image.tmdb.org/t/p/w500/iGzENlBPYJEFWZnye4t3nqWSSp1.jpg','2004-02-04',6.8,0),(21316,'Evil Eye','en','A seemingly perfect romance turns dark when a mother becomes convinced her daughter’s new boyfriend has a sinister connection to her own past.','https://image.tmdb.org/t/p/w500/lhExfe0yTZL2DRVkou9hnNlOcc9.jpg','2020-04-01',5.5,0),(21317,'Doomsday','en','The lethal Reaper virus spreads throughout Britain—infecting millions and killing hundreds of thousands. Authorities brutally and successfully quarantine the country but, three decades later, the virus resurfaces in a major city. An elite group of specialists is urgently dispatched into the still-quarantined country to retrieve a cure by any means necessary. Shut off from the rest of the world, the unit must battle through a landscape that has become a waking nightmare.','https://image.tmdb.org/t/p/w500/cKUmTyXgmhv8cMRCY9RYTKcAeTn.jpg','2008-03-14',6,0),(21318,'Werewolf: The Beast Among Us','en','Set in a 19th century village, a young man studying under a local doctor joins a team of hunters on the trail of a wolf-like creature.','https://image.tmdb.org/t/p/w500/9VHFRTE8TWSL2ivZaVcUEu6ACc1.jpg','2012-10-09',6,0),(21319,'Anne of Green Gables: The Sequel','en','Anne Shirley, now a schoolteacher, has begun writing stories and collecting rejection slips. She acts as Diana\'s maid of honor, develops a relationship with Gilbert Blythe, and finds herself at Kingsport Ladies\' College. But while Anne enjoys the battles and the friends she makes, she finds herself returning to Avonlea.','https://image.tmdb.org/t/p/w500/hofilKLz1UPR3nm7ooXXIdGhdTw.jpg','1987-05-19',8,0),(21320,'Another Egg and Chicken Movie','es','Toto, now a chicken, tries to live as such, while Willy and Bibi deal some problems between them. A sorcerer egg desert needs a chicken heart to cast a spell. He sends his armies of eggs vulture, ostrich and scorpion to kidnap Toto. His friends embark on a journey through the desert to rescue the chicken, where they live countless adventures','https://image.tmdb.org/t/p/w500/c7LMN9NrJQ97RxYM33qu5ItcbCn.jpg','2009-04-20',7.6,0),(21321,'Snow White: A Tale of Terror','en','When young Lili\'s mother dies in childbirth, her father remarries Lady Claudia, a woman ruled by an evil mirror with the power to make her queen of all living things.  After escaping an attempt on her life, Lili finds herself lost in a dark forest, where living happily ever after seems unlikely.','https://image.tmdb.org/t/p/w500/qoFccaw3SVzIFLRWAacFE3cyiig.jpg','1997-07-18',6,0),(21322,'Gulliver\'s Travels','en','Travel writer Lemuel Gulliver takes an assignment in Bermuda, but ends up on the island of Liliput, where he towers over its tiny citizens.','https://image.tmdb.org/t/p/w500/tazLyiF4q2w07jXjg4z4CQZgvY.jpg','2010-12-23',5.2,0),(21323,'Mandy','en','The Shadow Mountains, 1983. Red and Mandy lead a loving and peaceful existence; but when their pine-scented haven is savagely destroyed, Red is catapulted into a phantasmagoric journey filled with bloody vengeance and laced with fire.','https://image.tmdb.org/t/p/w500/m0yf7J7HsKeK6E81SMRcX8vx6mH.jpg','2018-09-13',6.2,0),(21324,'Enemy','en','A mild-mannered college professor discovers a look-alike actor and delves into the other man\'s private affairs.','https://image.tmdb.org/t/p/w500/vf40tyDRKZsBmaLsYeopzfFLzLx.jpg','2013-12-31',6.9,0),(21325,'Road Trip','en','From the director of the Hangover trilogy and Joker, Road Trip is a raunchy college comedy classic.  After an Ithaca college student films his one-night stand with a beautiful sorority girl, he discovers one of his friends has accidentally mailed the homemade porn tape to his girlfriend. In a frenzy, he must borrow a car and hit the road in a desperate bid to intercept the tape.  Featuring a talented cast that includes Breckin Meyer, Rachel Blanchard, Seann William Scott, Amy Smart, Fred Ward, Tom Green, Anthony Rapp, Andy Dick, and Ethan Suplee.','https://image.tmdb.org/t/p/w500/jee4eY5tZprI0V18S6PXUloBzSk.jpg','2000-05-19',6.2,0),(21326,'Brokedown Palace','en','Best friends Alice and Darlene take a trip to Thailand after graduating high school. In Thailand, they meet a captivating Australian man, who calls himself Nick Parks. Darlene is particularly smitten with Nick and convinces Alice to take Nick up on his offer to treat the two of them to what amounts to a day trip to Hong Kong. In the airport, the girls are seized by the police and shocked to discover that one of their bags contains heroin.','https://image.tmdb.org/t/p/w500/pWxoggA0KCS5oMPDOjIDYZYzryE.jpg','1999-08-13',6.4,0),(21327,'Torque','en','Biker Cary Ford is framed by an old rival and biker gang leader for the murder of another gang member who happens to be the brother of Trey, leader of the most feared biker gang in the country. Ford is now on the run trying to clear his name from the murder with Trey and his gang looking for his blood.','https://image.tmdb.org/t/p/w500/pY35tW8BMAjZewl87OxjXK8ui02.jpg','2004-01-16',5.2,0),(21328,'Bliss','en','A mind-bending love story following Greg who, after recently being divorced and then fired, meets the mysterious Isabel, a woman living on the streets and convinced that the polluted, broken world around them is just a computer simulation. Doubtful at first, Greg eventually discovers there may be some truth to Isabel’s wild conspiracy.','https://image.tmdb.org/t/p/w500/tbTiSr0v9g8Q34MIeIcT0o2vGus.jpg','2021-02-05',5.5,0),(21329,'Definitely, Maybe','en','When Will decides to tell his daughter the story of how he met her mother, he discovers that a second look at the past might also give him a second chance at the future.','https://image.tmdb.org/t/p/w500/oUdcZfd8r6HZRVIQeaTU0XtQFeQ.jpg','2008-02-08',6.9,0),(21330,'La Dolce Vita','it','Journalist and man-about-town Marcello struggles to find his place in the world, torn between the allure of Rome\'s elite social scene and the stifling domesticity offered by his girlfriend, all the while searching for a way to become a serious writer.','https://image.tmdb.org/t/p/w500/kZF1akNxeNJiCiMRWdF0fe0x48H.jpg','1960-02-05',8.2,0),(21331,'Dead Zone','en','To stop the collapse of humanity, an elite team of soldiers must descend on a radiation-poisoned town and perform the ultimate stealth mission using high-tech armor and weapons.','https://image.tmdb.org/t/p/w500/sT1XW0Mx5SEnpuTKNLYDWxRHtdn.jpg','2022-07-29',6.4,0),(21332,'All Hail','es','A famous TV weatherman, Miguel Flores, becomes public enemy number one when he fails to predict a terrible hailstorm. He is forced out of the 