nes of Michelangelo, Galileo, Vivaldi, and others for tens of millions of dollars to the world’s ultra-rich. But when they steal the Shroud of Turin and clone the DNA of Jesus Christ, all hell breaks loose.','https://image.tmdb.org/t/p/w500/1AWcMtUZjpkq4h52yDnNIp9FwEO.jpg','2023-01-13',7.2,0),(21338,'8-Bit Christmas','en','In suburban Chicago during the late 1980s, ten-year-old Jake Doyle embarks on a herculean quest to get the latest and greatest video game system for Christmas.','https://image.tmdb.org/t/p/w500/5YwaISdOwp8Zu6O7kwBeUn8a7Pu.jpg','2021-11-24',6.4,0),(21339,'The Tuxedo','en','Cabbie-turned-chauffeur Jimmy Tong learns there is really only one rule when you work for playboy millionaire Clark Devlin : Never touch Devlin\'s prized tuxedo. But when Devlin is temporarily put out of commission in an explosive accident, Jimmy puts on the tux and soon discovers that this extraordinary suit may be more black belt than black tie. Paired with a partner as inexperienced as he is, Jimmy becomes an unwitting secret agent.','https://image.tmdb.org/t/p/w500/2agrcNQRtgTsN5SbffC4H2BwYW2.jpg','2002-09-27',5.7,0),(21340,'The Final','en','A group of high school outcasts get revenge on the students that torment them.','https://image.tmdb.org/t/p/w500/3jPSvaW9veHVeaEll9DH7eoJ634.jpg','2010-01-28',6.1,0),(21341,'Inherent Vice','en','In Los Angeles at the turn of the 1970s, drug-fueled detective Larry \"Doc\" Sportello investigates the disappearance of an ex-girlfriend.','https://image.tmdb.org/t/p/w500/hyan5Uc0lGpPuad94DM1pLxneiP.jpg','2014-12-12',6.6,0),(21342,'Ginger Snaps','en','The story of two outcast sisters, Ginger and Brigitte, in the mindless suburban town of Bailey Downs. On the night of Ginger\'s first period, she is savagely attacked by a wild creature. Ginger\'s wounds miraculously heal but something is not quite right. Now Brigitte must save her sister and save herself.','https://image.tmdb.org/t/p/w500/ozohDiJd7Oi65NEf8B0ya7lR9Fr.jpg','2000-08-01',6.8,0),(21343,'Miami Vice','en','A case involving drug lords and murder in South Florida takes a personal turn for undercover detectives Sonny Crockett and Ricardo Tubbs. Unorthodox Crockett gets involved romantically with the Chinese-Cuban wife of a trafficker of arms and drugs, while Tubbs deals with an assault on those he loves.','https://image.tmdb.org/t/p/w500/3U9amX6UaKF8WE8vR57ruTuiP9X.jpg','2006-07-27',6,0),(21344,'Wedding Crashers','en','John and his buddy, Jeremy are emotional criminals who know how to use a woman\'s hopes and dreams for their own carnal gain. Their modus operandi: crashing weddings. Normally, they meet guests who want to toast the romantic day with a random hook-up. But when John meets Claire, he discovers what true love – and heartache – feels like.','https://image.tmdb.org/t/p/w500/lFM3lk2zVzC1YFnKm0r6LbFPyRu.jpg','2005-07-13',6.5,0),(21345,'My Sister\'s Keeper','en','Sara and Brian live an idyllic life with their young son and daughter. But their family is rocked by sudden, heartbreaking news that forces them to make a difficult and unorthodox choice in order to save their baby girl\'s life. The parents\' desperate decision raises both ethical and moral questions and rips away at the foundation of their relationship. Their actions ultimately set off a court case that threatens to tear the family apart, while revealing surprising truths that challenge everyone\'s perceptions of love and loyalty and give new meaning to the definition of healing.','https://image.tmdb.org/t/p/w500/atRGqnG7pe0hZP97RWDLrT2hRGZ.jpg','2009-06-26',7.4,0),(21346,'Book of Dragons','en','So you want to be a dragon trainer do you? Prepare yourself for adventure, excitement and training as Hiccup, Astrid, Toothless and Gobber tell the legend behind the Book of Dragons and reveal insider training secrets about new, never-before-seen dragons.','https://image.tmdb.org/t/p/w500/jDInObzAHYGsde02gTxL8B56HGT.jpg','2011-11-15',6.6,0),(21347,'The Red Point of Marriage','id','A couple\'s 