y.','https://image.tmdb.org/t/p/w500/bfZPNzAwUQZ6FZQi1d136KLr3wl.jpg','2021-12-02',6.5,0),(21353,'Gia','en','Gia Carangi travels to New York City with dreams of becoming a fashion model. Within minutes of arriving, she meets Wilhelmina Cooper, a wise and high-powered agent who takes Gia under her wing. With Cooper\'s help and her own natural instincts, Gia quickly shoots to the top of the modeling world. When Cooper dies of lung cancer, however, Gia turns to drugs – and both she and her career begin to spiral out of control.','https://image.tmdb.org/t/p/w500/oFi5OIvBf59W1KFaN0cuiMEEbs1.jpg','1998-01-31',7.1,0),(21354,'Rudolph the Red-Nosed Reindeer','en','Sam the snowman tells us the story of a young red-nosed reindeer who, after being ousted from the reindeer games because of his glowing nose, teams up with Hermey, an elf who wants to be a dentist, and Yukon Cornelius, the prospector. They run into the Abominable Snowman and find a whole island of misfit toys. Rudoph vows to see if he can get Santa to help the toys, and he goes back to the North Pole on Christmas Eve. But Santa\'s sleigh is fogged in. But when Santa looks over Rudolph, he gets a very bright idea...','https://image.tmdb.org/t/p/w500/xjAElUhXuc7zFJPj3qUHjcySNsE.jpg','1964-12-06',7.3,0),(21355,'The One','en','A sheriff\'s deputy fights an alternate universe version of himself who grows stronger with each alternate self he kills.','https://image.tmdb.org/t/p/w500/gcr3t71KmeXINemMrhaGBGVJPwW.jpg','2001-11-02',6.1,0),(21356,'Sator','en','Secluded in a desolate forest, a broken family is observed by Sator, a supernatural entity who is attempting to claim them.','https://image.tmdb.org/t/p/w500/zij3xfDWx2D8kckKjLPypgwLdK1.jpg','2019-07-21',5.2,0),(21357,'The Birds','en','Chic socialite Melanie Daniels enjoys a passing flirtation with an eligible attorney in a San Francisco pet shop and, on an impulse, follows him to his hometown bearing a gift of lovebirds. But upon her arrival, the bird population runs amok. Suddenly, the townsfolk face a massive avian onslaught, with the feathered fiends inexplicably attacking people all over Bodega Bay.','https://image.tmdb.org/t/p/w500/z0iYrJ6GsAMP3abOha7uGMuc5kZ.jpg','1963-03-28',7.5,0),(21358,'Adore','en','Lil and Roz are two lifelong friends, having grown up together as neighbors in an idyllic beach town. As adults, their sons have developed a friendship as strong as that which binds their mothers. One summer, all four are confronted by simmering emotions that have been mounting between them, and each find unexpected happiness in relationships that cross the bounds of convention.','https://image.tmdb.org/t/p/w500/hIQqIeG7Ude0QRUFntdLtsAUEBB.jpg','2013-04-03',6.1,0),(21359,'Thawing Out','fr','Léo is dragged to a nudist camping resort by his mother. Like most boys at the age of 12 or 13, being nude in public holds little appeal for Léo, who protests by wearing extra layers. Until he meets a certain special girl, who captures his heart and releases his inhibitions.','https://image.tmdb.org/t/p/w500/yu2lpgsWZg3u8LrYkM23S0VRHk6.jpg','2009-01-31',5.7,0),(21360,'How Much Do You Love Me?','fr','After winning the lottery, François goes to a bar in Pigalle and offers one hundred thousand Euros per month to a prostitute named Daniela to live with him as his wife until his money runs out.','https://image.tmdb.org/t/p/w500/jD18aRBrHtr9YnwJoLdqPntxDGr.jpg','2005-10-26',5.7,0),(21361,'1922','en','A simple yet proud rancher conspires to murder his wife for financial gain, convincing his teenage son to participate.','https://image.tmdb.org/t/p/w500/q4FQOiSRhTLWulHl5Vpg37FMArH.jpg','2017-10-20',5.9,0),(21362,'Enough','en','Working-class waitress Slim thought she was entering a life of domestic bliss when she married Mitch, the man of her dreams. After the arrival of their first child, her picture perfect life is shattered when she discovers Mitch\'s hidden possessive dark side, a controlling and abusive alter ego that can turn trust, love and tranquility into terror. Terrified for her child\'s safety, Slim flees with her daughter. Relentless in his pursuit and enlisting the aid of lethal henchmen, Mitch continually stalks the prey that was once his family.','https://image.tmdb.org/t/p/w500/4glaIcIRw0IVmQKWYVK6CIo0zaU.jpg','2002-05-21',6.6,0),(21363,'Argo','en','As the Iranian revolution reaches a boiling point, a CIA \'exfiltration\' specialist concocts a risky plan to free six Americans who have found shelter at the home of the Canadian ambassador.','https://image.tmdb.org/t/p/w500/m5gPWFZFIp4UJFABgWyLkbXv8GX.jpg','2012-03-22',7.3,0),(21364,'Get Smart With Money','en','Financial advisers share their simple tips on spending less and saving more with people looking to take control of their funds and achieve their goals.','https://image.tmdb.org/t/p/w500/uyfDg5RTdBUZ3kC5Ft43ZmXqhMr.jpg','2022-09-06',6.2,0),(21365,'Good Mourning','en','Movie star London Clash gets his world turned upside down when he must choose between pursuing his one true love and landing a life-changing starring role in a major motion picture.','https://image.tmdb.org/t/p/w500/sCKD2tbldX3jDtsOVU2QVGTw6Ua.jpg','2022-05-20',5.7,0),(21366,'Immoral Tales','fr','Four erotic tales from in various historical eras. The first, \'The Tide\', is set in the present day, and concerns a student and his young female cousin stranded on the beach by the tide, secluded from prying eyes. \'Therese Philosophe\' is set in the nineteenth century, and concerns a girl being locked in her bedroom, where she contemplates the erotic potential of the objects contained within it. \'Erzsebet Bathory\' is a portrait of the sixteenth-century countess who allegedly bathed in the blood of virgins, while \'Lucrezia Borgia\' concerns an incestuous fifteenth-century orgy involving Lucrezia, her brother, and her father the Pope.','https://image.tmdb.org/t/p/w500/dFPQD3e5uonv7bKTYsi7TqtKxYx.jpg','1973-11-01',5.8,0),(21367,'That\'s Amor','en','After her job and relationship implode on the same day, Sofia starts from scratch — and meets a dashing Spanish chef who might be her missing ingredient.','https://image.tmdb.org/t/p/w500/iyYibVfi8q0zwsX1evl7mxTZJp1.jpg','2022-08-25',5.1,0),(21368,'Fear of Rain','en','A teenage girl living with schizophrenia begins to suspect her neighbor has kidnapped a child. Her parents try desperately to help her live a normal life, without exposing their own tragic secrets, and the only person who believes her is Caleb – a boy she isn’t even sure exists.','https://image.tmdb.org/t/p/w500/5hmaACPJfI2M0v38DeltW3dSggT.jpg','2021-02-12',7.1,0),(21369,'Legend','en','Set in a timeless mythical forest inhabited by fairies, goblins, unicorns and mortals, this fantastic story follows a mystical forest dweller, chosen by fate, to undertake a heroic quest. He must save the beautiful Princess  Lili and defeat the demonic Lord of Darkness, or the world will be plunged into a never-ending ice age.','https://image.tmdb.org/t/p/w500/6n3PQSYpZRK5YPk2w8JEwED7AZk.jpg','1985-08-28',6.3,0),(21370,'The Last King','no','Norway, 1204. A civil war between the birkebeiners —the king\'s men— and the baglers —supporters of the Norwegian aristocracy and the Church— ravages the country. Two men must protect a baby, the illegitimate son of King Håkon, who will be the future king and peacemaker, from those who want to kill him.','https://image.tmdb.org/t/p/w500/fw7dUolSTtkfwVFj7OPYymGxpSn.jpg','2016-02-12',5.7,0),(21371,'Above Suspicion','en','The chilling true story of a newly married FBI poster boy assigned to an Appalachian mountain town in Kentucky. There he is drawn into an illicit affair with an impoverished local woman who becomes his star informant. She sees in him her means of escape; instead, it\'s a ticket to disaster for both of them.','https://image.tmdb.org/t/p/w500/kpZ2SfwLHjuf2HmgaFko32cPgbl.jpg','2019-06-20',6,0),(21372,'Breaking Surface','sv','Two Swedish/Norwegian half sisters go on a winter diving trip in Northern Norway, when they get trapped after a rockslide.','https://image.tmdb.org/t/p/w500/zlOvKg5WkXcwcmqy2KaiXoXLAky.jpg','2020-02-14',6.8,0),(21373,'Looney Tunes: Back in Action','en','Fed up with all the attention going to Bugs Bunny, Daffy Duck quits Hollywood, teams up with recently-fired stuntman Damien Drake Jr. and embarks on a round-the-world adventure, along with Bugs and The VP of Warner Bros. Their mission? Find Damien\'s father, and the missing blue diamond... and stay one step ahead of The Acme Corp., who wants the diamond for their own purposes.','https://image.tmdb.org/t/p/w500/pNrQaH0ATrz9wFrNpwfB1aU4MpK.jpg','2003-11-14',6.4,0),(21374,'The Dirty Dozen','en','12 American military prisoners in World War II are ordered to infiltrate a well-guarded enemy château and kill the Nazi officers vacationing there. The soldiers, most of whom are facing death sentences for a variety of violent crimes, agree to the mission and the possible commuting of their sentences.','https://image.tmdb.org/t/p/w500/iFpgjfE4gt7guOLvrqgZZoO4Rjk.jpg','1967-06-15',7.6,0),(21375,'Leprechaun in the Hood','en','When Butch, Postmaster P, and Stray Bullet loot the local hip-hop mogul\'s studio to fund their demo album, the threesome unwittingly ends up with the secret of Mack Daddy\'s success: a magical flute. Their gigs instantly turn golden but a blood-thristy Leprechaun and an angry Mack Daddy are hot on their trail, leaving a wake of destruction tainted by politically incorrect limericks.','https://image.tmdb.org/t/p/w500/lCRwtuxnJWkZ04gwtfYF9h1GUkl.jpg','2000-03-28',5,0),(21376,'Miss Violence','el','On the day of her birthday, eleven-year-old Angeliki jumps off the balcony and falls to her death with a smile on her face. While the police and Social Services try to discover the reason for this apparent suicide, Angeliki\'s family keep insisting that it was an accident. What is the secret that young Angeliki took with her? Why does her family persist in trying to \"forget\" her and to move on with its life?','https://image.tmdb.org/t/p/w500/pEGEVgqLwhDV8ZGG5DK7NHDIU3T.jpg','2013-09-09',7.1,0),(21377,'Duel','en','Traveling businessman David Mann angers the driver of a rusty tanker while crossing the California desert. A simple trip turns deadly, as Mann struggles to stay on the road while the tanker plays cat and mouse with his life.','https://image.tmdb.org/t/p/w500/5UGyUqJGeaGk2mQxdtHIfqykTtb.jpg','1971-11-13',7.4,0),(21378,'Frida','en','A biography of artist Frida Kahlo, who channeled the pain of a crippling injury and her tempestuous marriage into her work.','https://image.tmdb.org/t/p/w500/a4hgR6aKoohB6MHni171jbi9BkU.jpg','2002-08-29',7.4,0),(21379,'If I Were a Boy','fr','Jeanne wakes up one morning and her life is about to take a funny turn, at first sight nothing has changed in her - to a small detail.','https://image.tmdb.org/t/p/w500/szCUtLRTN10N5Zjl8ZGoJOYmRrC.jpg','2017-02-22',5.3,0),(21380,'Fatal Attraction','en','For Dan Gallagher, life is good. He is on the rise at his New York law firm, is happily married to his wife, Beth, and has a loving daughter. But, after a casual fling with a sultry book editor named Alex, everything changes. Jilted by Dan, Alex becomes unstable, her behavior escalating from aggressive pursuit to obsessive stalking. Dan realizes that his main problem is not hiding his affair, but rather saving himself and his family.','https://image.tmdb.org/t/p/w500/6QWziDIbcVVpnTGuaKjcxXC9Kl4.jpg','1987-09-11',6.8,0),(21381,'Born a Champion','en','After a blood- soaked jujitsu match in Dubai, fighting legend Mickey Kelley falls to superstar Blaine. But years later, an online video proves that Blaine cheated, and the world demands a rematch. Can the aging underdog get back into shape in time to vanquish his foe, get revenge, and claim his prize?','https://image.tmdb.org/t/p/w500/ijizwYu2B04gVkrbGlclAAfdN3p.jpg','2021-01-22',7.1,0),(21382,'The Nut Job 2: Nutty by Nature','en','When the evil mayor of Oakton decides to bulldoze Liberty 