elf in the odd dystopian world. A world that is filled with the memories of all current coma patients. Just like a human memory this world is fragmental, chaotic and unstable. This is COMA: icecaps, rivers and cities can all exist in a space of a single room and laws of physics are no longer laws as they can be bent.','https://image.tmdb.org/t/p/w500/ijJm0RSeKIr67qkHLtSmtigS6ra.jpg','2019-11-19',6.3,0),(21408,'Mirrors 2','en','When Max, who is recovering from a traumatic accident, takes a job as a nighttime security guard, he begins to see visions of a young mysterious woman in the store\'s mirror.','https://image.tmdb.org/t/p/w500/gDr5TaM129kUNwXkUUZ7Cha2CNn.jpg','2010-10-18',5.6,0),(21409,'Adventures in Babysitting','en','When plans with her boyfriend fall through, high school senior Chris Parker ends up babysitting the Anderson kids, Brad and Sara. What should be a quiet night in, however, turns into a series of ridiculous exploits, starting when they leave the house to pick up Chris\' friend Brenda. Soon, Brad\'s buddy Daryl is involved, and the group must contend with car thieves, blues musicians and much more.','https://image.tmdb.org/t/p/w500/8QiAj0Xw2UMeZMIIfZKeNoIsszs.jpg','1987-07-01',6.9,0),(21410,'Blair Witch','en','Students on a camping trip discover something sinister is lurking beyond the trees.','https://image.tmdb.org/t/p/w500/chgLLNv3bMSOptaciOUPtDcAggq.jpg','2016-09-15',5.2,0),(21411,'Rise of the Mummy','en','A group of archaeology students awaken an ancient mummy. After being trapped in a time loop, the only way they can escape, is to defeat the mummy. As the body count rises, it seems the Mummy has to collect the souls of those who woke him to be able to walk the earth - for good.','https://image.tmdb.org/t/p/w500/tmghT8HaddVIS9hEXIOI9GuDchi.jpg','2021-04-03',5.3,0),(21412,'Lost Bullet','fr','A small time delinquent, turned police mechanic for a go fast task force, is forced to defend his innocence when his mentor is killed by dirty cops.','http