h of his wife, for which the surgeon appears responsible...','https://image.tmdb.org/t/p/w500/xQ7tIsprm1gvsDKH4qCvCX49YAC.jpg','1993-05-11',5.6,0),(21436,'Honey, I Blew Up the Kid','en','Wayne Szalinski is at it again. But instead of shrinking things, he tries to make a machine that can make things grow. As in the first one, his machine isn\'t quite accurate. But when he brings Nick & his toddler son Adam to see his invention, the machine unexpectedly starts working. And when Adam comes right up to the machine, he gets zapped along with his stuffed bunny.','https://image.tmdb.org/t/p/w500/iLWZJAIcSqthsmJ3pMbtiE9Ap6N.jpg','1992-07-16',5.2,0),(21437,'You Were Never Really Here','en','A traumatised veteran, unafraid of violence, tracks down missing girls for a living. When a job spins out of control, his nightmares overtake him as a conspiracy is uncovered leading to what may be his death trip or his awakening.','https://image.tmdb.org/t/p/w500/px6v0kY4rmHOcBTA7zelfD196Sd.jpg','2017-11-08',6.6,0),(21438,'Professor Marston and the Wonder Women','en','The unconventional life of Dr. William Marston, the Harvard psychologist and inventor who helped invent the modern lie detector test and created Wonder Woman in 1941.','https://image.tmdb.org/t/p/w500/tbrzHlnE8dNpllLWEe9bwDGNzLe.jpg','2017-10-13',7.2,0),(21439,'Arthur and the Revenge of Maltazard','fr','Arthur answers a distress call from Princess Selenia, who is menaced by the nefarious Maltazard.','https://image.tmdb.org/t/p/w500/rHCL0HwlQvU01TLRRHZFlvsVEqt.jpg','2009-11-26',5.7,0),(21440,'A Man Called Ove','sv','Despite being deposed as president of his condominium association, grumpy 59-year-old Ove continues to watch over his neighbourhood with an iron fist. When pregnant Parvaneh and her family move into the terraced house opposite Ove and she accidentally back into Ove’s mailbox, it sets off a series of unexpected changes in his life.','https://image.tmdb.org/t/p/w500/a41uvFqze4PI7N3E9jPNwN9ypV.jpg','2015-12-25',7.6,