ogether to control their bodies in the big Bitecentennial Play and stop one of Sparky\'s experiments from destroying imperfectly perfect Monster High!','https://image.tmdb.org/t/p/w500/9uzE33joqoAhXpaDqAFSKPMs4E4.jpg','2014-10-06',7.8,0),(21501,'Sahara','en','Scouring the ocean depths for treasure-laden shipwrecks is business as usual for a thrill-seeking underwater adventurer and his wisecracking buddy. But when these two cross paths with a beautiful doctor, they find themselves on the ultimate treasure hunt.','https://image.tmdb.org/t/p/w500/kyY1onYxkKBDlJsheRsVbMaoQEM.jpg','2005-04-06',5.9,0),(21502,'LEGO Star Wars Holiday Special','en','As her friends prep for a Life Day holiday celebration, Rey journeys with BB-8 on a quest to gain a deeper knowledge of the Force at a mysterious Jedi Temple. There, she embarks on a cross-timeline adventure through beloved moments in Star Wars history, coming into contact with iconic heroes and villains from all eras of the saga. But will she make it back in time for the Life Day feast?','https://image.tmdb.org/t/p/w500/zyzJSI7UZZzz5Toj10rYGF5689z.jpg','2020-11-17',6.6,0),(21503,'Leprechaun 4: In Space','en','On a planet in a distant galaxy, a power hungry Leprechaun, holds a beautiful alien princess hostage in order to marry her for her royal title. With her title and his beloved gold, he\'ll be able to rule the universe. While making his maniacal plans, what he doesn\'t count on is an invading platoon of marines from Earth, to save the princess and foil his plans. An accomplished trickster, the Leprechaun stows himself away on the orbiting spaceship and wreaks havoc on the crew in an attempt to recapture his bride.','https://image.tmdb.org/t/p/w500/8uMaa4VnNN2TS42tGYu04we7GOM.jpg','1996-12-25',4.6,0),(21504,'Student Services','fr','Nineteen-year-old Laura is stressed by her first year at college when money worries distract her from her studies and so, desperate for cash, she answers an online advertisement for intimate compani