y amount of confidence and believe she\'s drop dead gorgeous.','https://image.tmdb.org/t/p/w500/rmP8b6vxbpK1sPinnUqXHKq0VkT.jpg','2018-04-19',6.4,0),(21547,'We Die Young','en','Lucas, a 14-year-old boy inducted into the gang life in Washington D.C., is determined that his 10-year-old brother won\'t follow the same path. When an Afghanistan war veteran comes into the neighborhood, an opportunity arises.','https://image.tmdb.org/t/p/w500/dB0Dl2nDRmvplaJLeHSfkppJXHs.jpg','2019-05-09',6.9,0),(21548,'Above the Law','en','Nico Toscani is an Italian immigrant, American patriot, ex-CIA agent, aikido specialist and unorthodox Chicago policeman. He is as committed to his job as he is to his personalized brand of justice—expert and thorough bone-crushing.','https://image.tmdb.org/t/p/w500/20bD11jTM2fbVGkDnkCpfriUW4y.jpg','1988-04-08',6.1,0),(21549,'The Animal','en','When loser Marvin Mange is involved in a horrible car accident, he\'s brought back to life by a deranged scientist as half man and half animal. His newfound powers are awesome -- but their adverse side effects could take over his life. Now, Marvin must fight to control his crazy primal urges around his new squeeze, Rianna, and his rival, Sgt. Sisk, who both think he\'s one cool cat.','https://image.tmdb.org/t/p/w500/oNxEXmKTZtECHs0bQbI6dQoXYMV.jpg','2001-06-01',5.1,0),(21550,'Cellular','en','A young man receives an emergency phone call on his cell phone from an older woman. She claims to have been kidnapped – and the kidnappers have targeted her husband and child next.','https://image.tmdb.org/t/p/w500/AhD3qVfVmxz5CXDxctXwK5nmrOp.jpg','2004-09-06',6.4,0),(21551,'A Wrinkle in Time','en','After the disappearance of her scientist father, three peculiar beings send Meg, her brother, and her friend to space in order to find him.','https://image.tmdb.org/t/p/w500/yAcb58vipewa1BfNit2RjE6boXA.jpg','2018-03-08',5.1,0),(21552,'Dragon Ball Z: The Fall of Men','en','The World isn\'t like it\'s supposed to be. Something happene