,0),(21557,'Fugitive: The Curious Case of Carlos Ghosn','fr','From his rise as a business mogul to his plummet into international notoriety, this true crime documentary examines the bizarre story of Carlos Ghosn.','https://image.tmdb.org/t/p/w500/hseWVp5HVvJv7BTrBDrSMq0UBzf.jpg','2022-09-26',6.1,0),(21558,'Inferno','en','Eddie Lomax (Jean-Claude Van Damme) is a drifter who has been in a suicidal funk since the death of his close friend Johnny (Danny Trejo). Riding his motorcycle into a small desert town where Johnny once lived, Lomax is confronted by a gang of toughs, who beat him and steal his bike. However, Lomax is not a man to take an injustice lying down, and soon he begins exacting a violent revenge on the men who stole his motorcycle, with local handyman Jubal Early (Pat Morita) lending a hand and several area ladies offering aid and comfort.','https://image.tmdb.org/t/p/w500/dFlI0Vb4JOsRXG1JSS2Ufs6Sp8k.jpg','1999-09-25',6.1,0),(21559,'Camp Rock 2: The Final Jam','en','Mitchie can\'t wait to go back to Camp Rock and spend the summer making new music with her friends and superstar Shane Gray. But the slick new camp across the lake, Camp Star, has drummed up some serious competition – featuring newcomers Luke and Dana. In a sensational battle of the bands, with Camp Rock\'s future at stake, will Camp Star\'s flashy production and over-the-top antics win out, or will Camp Rockers prove that music, teamwork, and spirit are what truly matter?','https://image.tmdb.org/t/p/w500/8RSdWqC259zR72Jjo6ANAM4ndhM.jpg','2010-09-17',6.3,0),(21560,'Daybreakers','en','In the year 2019, a plague has transformed almost every human into a vampire. Faced with a dwindling blood supply, the fractured dominant race plots their survival; meanwhile, a researcher works with a covert band of vampires on a way to save humankind.','https://image.tmdb.org/t/p/w500/xFZH2l9UOyIclk2ZFWNHQ38B2RP.jpg','2009-10-01',6.3,0),(21561,'Jackie Brown','en','Jackie Brown is a flight attendant who gets caught in the middle of smuggling cash into the country for her gunrunner boss. When the cops try to use Jackie to get to her boss, she hatches a plan — with help from a bail bondsman — to keep the money for herself.','https://image.tmdb.org/t/p/w500/ewbLUXvm4riZL0aepy90o0vMesn.jpg','1997-04-10',7.4,0),(21562,'Phantom Thread','en','In 1950s London, renowned British dressmaker Reynolds Woodcock comes across Alma, a young, strong-willed woman, who soon becomes ever present in his life as his muse and lover.','https://image.tmdb.org/t/p/w500/hgoWjp9Sh0MI97eAMZCnIoVfgvq.jpg','2017-12-25',7.3,0),(21563,'A Man Apart','en','When Vetter\'s wife is killed in a botched hit organized by Diablo, he seeks revenge against those responsible. But in the process, Vetter and Hicks have to fight their way up the chain to get to Diablo but it\'s easier said than done when all Vetter can focus on is revenge.','https://image.tmdb.org/t/p/w500/z0JUBNk4BTBmeMOudrRH9GnOmK0.jpg','2003-04-04',6.1,0),(21564,'Peaky Blinders: The True Story','en','The story of the real Peaky Blinders and how they became a TV sensation. Hear of the actual gangsters who became leading characters in the series and the real events behind many of the main story lines, learn the identity of the crime family that inspired the Shelbys, then take a tour of the film locations where the dark and violent world of the Peaky Blinders was recreated.','https://image.tmdb.org/t/p/w500/m3X9EfwgGfSC1lschAuzWuPNI9r.jpg','2016-04-02',8.5,0),(21565,'All Eyez on Me','en','All Eyez on Me chronicles the life and legacy of Tupac Shakur, including his rise to superstardom as a hip-hop artist, actor, poet and activist, as well as his imprisonment and prolific, controversial time at Death Row Records. Against insurmountable odds, Tupac rose to become a cultural icon whose career and persona both continue to grow long after his passing.','https://image.tmdb.org/t/p/w500/zmgsaKFWbmZ1Grz4SO0PLNxilv3.jpg','2017-06-12',6.7,0),(21566,'The Forbidden Legend: Sex & Chopsticks','cn','Based on the classic Chinese novel \"Jin Ping Mei,\" written during the Ming Dynasty. The novel itself is the first full length Chinese fictional work to depict sexuality in explicit manner. The movie (as well as novel) takes place during 1111-1127 and centers around Ximen Quing, a corrupt social climber and lustful merchant who is wealthy enough to marry a consort of wives and concubines.','https://image.tmdb.org/t/p/w500/ugsOXzNOocg3kMWPiWCOAvvJswI.jpg','2008-09-19',5.7,0),(21567,'The English Patient','en','In the 1930s, Count Almásy is a Hungarian map maker employed by the Royal Geographical Society to chart the vast expanses of the Sahara Desert along with several other prominent explorers. As World War II unfolds, Almásy enters into a world of love, betrayal, and politics.','https://image.tmdb.org/t/p/w500/yqaKkARc9Ku8mIENQt8bGVHaowJ.jpg','1996-11-05',7.2,0),(21568,'Doom: Annihilation','en','A group of UAC Marines responds to a distress call from a top-secret scientific base on Phobos, a Martian moon, only to discover it\'s been overrun by demons.','https://image.tmdb.org/t/p/w500/7EGElXVSNnqcPjuhXPd6UVUX1rD.jpg','2019-09-30',4.9,0),(21569,'Max','en','A dog that helped soldiers in Afghanistan returns to the U.S. and is adopted by his handler\'s family after suffering a traumatic experience.','https://image.tmdb.org/t/p/w500/d3ACos3t4YwXML8keTA0wKN8e36.jpg','2015-06-26',7.1,0),(21570,'The Wedding Veil Journey','en','Tracy and Nick agree to set aside work to make time for a long overdue honeymoon to Greece. However, they soon find themselves confronting life choices when they get stranded on a secluded island.','https://image.tmdb.org/t/p/w500/c5ckuP063ZgiV1A3WfuF5jtHHA0.jpg','2023-01-21',6.7,0),(21571,'Tod@s Caen','es','A pair of seducers try to prove who has the best techniques while trying not to fall in love with each other.','https://image.tmdb.org/t/p/w500/maqsygPJvhESIOQGclUAEEWxNC.jpg','2019-08-30',7.8,0),(21572,'The Salvation','da','In 1870s America, a peaceful American settler kills his family\'s murderer which unleashes the fury of a notorious gang leader. His cowardly fellow townspeople then betray him, forcing him to hunt down the outlaws alone.','https://image.tmdb.org/t/p/w500/xQsv3OI8UT6s9Rn3C0WxO24bnEx.jpg','2014-05-22',6.4,0),(21573,'The Underground Banker','cn','A man\'s family is torn apart when his wife takes a loan from a loan shark who will stop at nothing to get his money back.','https://image.tmdb.org/t/p/w500/gRYLPJUVt8ERkdBCR4FWu5njkZ6.jpg','1994-01-22',5.5,0),(21574,'Metropolis','de','In a futuristic city sharply divided between the rich and the poor, the son of the city\'s mastermind meets a prophet who predicts the coming of a savior to mediate their differences.','https://image.tmdb.org/t/p/w500/hUK9rewffKGqtXynH5SW3v9hzcu.jpg','1927-02-06',8.2,0),(21575,'Get Hard','en','When obscenely rich hedge-fund manager James is convicted of fraud and sentenced to a stretch in San Quentin, the judge gives him one month to get his affairs in order. Knowing that he won\'t survive more than a few minutes in prison on his own, James desperately turns to Darnell-- a black businessman who\'s never even had a parking ticket -- for help. As Darnell puts James through the wringer, both learn that they were wrong about many things, including each other.','https://image.tmdb.org/t/p/w500/rJPbS2cYOYhDCjT5NmW1Fm6gFl3.jpg','2015-03-26',6,0),(21576,'Thumbelina','en','The tiny girl meets a fairy prince who saves her from the creatures of the woods.','https://image.tmdb.org/t/p/w500/eBvSSfwAKgcjF4eyaeNSzTCpfaF.jpg','1994-03-29',6.5,0),(21577,'A Chinese Odyssey Part Two: Cinderella','cn','This sequel to \"Pandora\'s Box\" continues director Jeffrey Lau\'s adaptation of the Buddhism saga \"Journey to the West\". Stranded five centuries in the past, Joker Monkey King must battle a variety of monsters, seductive women and super-powered villains to save the dying Pak Jing-Jing.','https://image.t