g to find out what happened to him with the strong deja vu he has. Day by day, Ah-lun finds out that his biggest task is to tie this red string on the love of his life Xiao-mi with someone else and that will separate them for eternity.','https://image.tmdb.org/t/p/w500/heWQxesmAiUmsbyz2p4RJm3tEgt.jpg','2021-11-24',6.4,0),(21583,'The Thin Red Line','en','The story of a group of men, an Army Rifle company called C-for-Charlie, who change, suffer, and ultimately make essential discoveries about themselves during the fierce World War II battle of Guadalcanal. It follows their journey, from the surprise of an unopposed landing, through the bloody and exhausting battles that follow, to the ultimate departure of those who survived.','https://image.tmdb.org/t/p/w500/tMmX3tOOZDNlHY2AvUnQPyVsxXn.jpg','1998-12-25',7.5,0),(21584,'The Strangers: Prey at Night','en','A family’s road trip takes a dangerous turn when they arrive at a secluded mobile home park to stay with some relatives and find it mysteriously deserted. Under the cover of darkness, three masked killers pay them a visit to test the family’s every limit as they struggle to survive.','https://image.tmdb.org/t/p/w500/vdxLpPsZkPZdFrREp7eSeSzcimj.jpg','2018-03-07',5.6,0),(21585,'Downton Abbey','en','The beloved Crawleys and their intrepid staff prepare for the most important moment of their lives. A royal visit from the King and Queen of England will unleash scandal, romance and intrigue that will leave the future of Downton hanging in the balance.','https://image.tmdb.org/t/p/w500/pWt1iRuhNpeVDNP2QiUT2C5OiBt.jpg','2019-09-12',7.1,0),(21586,'George of the Jungle','en','Deep in the African jungle, a baby named George, the sole survivor of a plane crash, is raised by gorillas. George grows up to be a buff and lovable klutz who has a rain forest full of animal friends: Tookie, his big-beaked toucan messenger; Ape, a witty talking gorilla; and Shep, a peanut-loving pooch of an elephant. But when poachers mess with George\'s