nts him dead.','https://image.tmdb.org/t/p/w500/khAED7ox0Dfk4Ef5LAf6jPEe4oy.jpg','2016-01-15',5.6,0),(21592,'The Number 23','en','Walter Sparrow is an animal control officer that becomes obsessed with a mysterious book that seems to be based on his own life. As soon as he opens the book, he notices strange parallels between what he reads and what he\'s experienced. But now he\'s worried that a fictional murder might materialize.','https://image.tmdb.org/t/p/w500/mlNU8a1SkTu6cKA4LAoZxfNPng0.jpg','2007-02-23',6.4,0),(21593,'Revolt','en','The story of humankind\'s last stand against a cataclysmic alien invasion. Set in the war-ravaged African countryside, a U.S. soldier and a French foreign aid worker team up to survive the alien onslaught. Their bond will be tested as they search for refuge across a crumbling world.','https://image.tmdb.org/t/p/w500/eM2zipCkAXhp0BZF2noDp7bRFgV.jpg','2017-07-01',5.5,0),(21594,'Emmanuelle 7','fr','Through the wonders of virtual reality, Emmanuelle tries to help a former schoolmate to overcome a traumatic sexual past.','https://image.tmdb.org/t/p/w500/p9u3RpYAxSmtLs7A55BLmoszWDL.jpg','1993-09-19',4.5,0),(21595,'Chef','en','When Chef Carl Casper suddenly quits his job at a prominent Los Angeles restaurant after refusing to compromise his creative integrity for its controlling owner, he is left to figure out what\'s next. Finding himself in Miami, he teams up with his ex-wife, his friend and his son to launch a food truck. Taking to the road, Chef Carl goes back to his roots to reignite his passion for the kitchen -- and zest for life and love.','https://image.tmdb.org/t/p/w500/yMtKHR6VG1Yagvv5F7IFpsGBm66.jpg','2014-05-08',7.1,0),(21596,'Minari','en','David, a 7-year-old Korean-American boy, gets his life turned upside down when his father decides to move their family to rural Arkansas and start a farm in the mid-1980s.','https://image.tmdb.org/t/p/w500/6mPNdmjdbVKPITv3LLCmQoKs9Zw.jpg','2021-02-12',7.4,0),(21597,'Don\'t Kill It','en','Demon hunter, Jebediah Huntley teams up with an FBI agent to battle a supernatural force in the southern state of Mississippi.','https://image.tmdb.org/t/p/w500/iQey3UeqU4uQzr82GQJ1pZMwe40.jpg','2016-08-27',6,0),(21598,'Taxi 4','fr','Before being extradited to Africa to stand trial, a notorious Belgian criminal is entrusted to the Marseilles police department for less than 24 hours. But the wily crook convinces bumbling policeman Emilien he\'s a lowly Belgian embassy employee who got railroaded by the brilliant master criminal.','https://image.tmdb.org/t/p/w500/8OoVXQo23kgMw4ooLfi2mDGVfUE.jpg','2007-02-10',5.6,0),(21599,'Deep Blue Sea','en','Researchers on the undersea lab Aquatica have genetically altered the brains of captive sharks to develop a cure for Alzheimer\'s disease. But there\'s an unexpected side effect: the sharks got smarter, faster, and more dangerous. After a big storm damages their remote research facility, they must fight for their lives.','https://image.tmdb.org/t/p/w500/fyn0zyCI4kIlbDoHH0Hzv09hDC5.jpg','1999-07-28',5.9,0),(21600,'Traffik','en','A couple off for a romantic weekend in the mountains are accosted by a biker gang. Alone in the mountains, Brea and John must defend themselves against the gang, who will stop at nothing to protect their secrets.','https://image.tmdb.org/t/p/w500/jwsmeU8mYEP6GpxJ2sbCzc2MQmi.jpg','2018-04-20',6.2,0),(21601,'Double Jeopardy','en','Framed for the murder of her husband, Libby Parsons survives the long years in prison with two burning desires sustaining her -- finding her son and solving the mystery that destroyed her once-happy life. Standing between her and her quest; however, is her parole officer, Travis Lehman. Libby poses a challenge to the cynical officer, one that forces him to face up to his own failings while pitting him against his superiors and law enforcement colleagues.','https://image.tmdb.org/t/p/w500/lSYMeHoUh9uWX2kXi9Fqe4BX2Ml.jpg','1999-09-24',6.5,0),(21602,'Snow Falls','en','After a winter storm strands five friends in a remote cabin with no power and little food, disorientation slowly claims their sanity as each of them succumbs to a fear that the snow itself may be contaminated or somehow evil.','https://image.tmdb.org/t/p/w500/wfZklSVDJPpHT0Arq4A8GY8Q9S9.jpg','2023-01-17',5.1,0),(21603,'Morgue','es','On his first day as a security guard, Diego Martinez is assigned to the night shift at the Hospital Regional. On his rounds, he notices the hallways can be unsettling at night until he accidentally notices he’s trapped inside the morgue.','https://image.tmdb.org/t/p/w500/m0u2fBIPwAi9gM693QaXhV2aoHq.jpg','2019-08-22',7.1,0),(21604,'Waves','en','A controlling father’s attempts to ensure that his two children succeed in high school backfire after his son experiences a career-ending sports injury. Their familial bonds are eventually placed under severe strain by an unexpected tragedy.','https://image.tmdb.org/t/p/w500/3xbjL0z8iH8e8L3USyeKGQrBfuZ.jpg','2019-11-15',7.4,0),(21605,'Chill Out, Scooby-Doo!','en','The gang\'s vacation to Paris takes a wrong turn when Scooby and Shaggy miss their flight and end up on a skydiving expedition in the Himalayas. To make matters worse, upon arrival they must outrun the Abominable Snowmonster.','https://image.tmdb.org/t/p/w500/n1SgvnX4SJ6gZEpDSQEbcmQOslJ.jpg','2007-09-04',7.6,0),(21606,'Free Willy 3: The Rescue','en','Willy the whale is back, this time threatened by illegal whalers making money off sushi. Jesse, now 16, has taken a job on an orca-researching ship, along with old friend Randolph and a sarcastic scientist, Drew. On the whaler\'s ship is captain John Wesley and his son, Max, who isn\'t really pleased about his father\'s job, but doesn\'t have the gut to say so. Along the way, Willy reunites with Jesse','https://image.tmdb.org/t/p/w500/xzca4bxgP2aEMlPTyq5vqhsunFB.jpg','1997-08-08',6.3,0),(21607,'Murder Party','fr','Jeanne, a brilliant architect has a new assignment: renovate the sumptuous Daguerre mansion owned 