e daughter is coming of age. The mother immediately gets in love with him, which causing to the daughter a terrible jealousy. And then the daughter chooses the most unfailing weapon - she tries to discourage him from her mother. She tries to get his attention by parading around without panties, asking his help with her shower, and rubbing up against him and flashing him whenever her mother is not looking. She is even trying to convince her mom, that since she is becoming a woman, that he should teach her some of the finer points of love. Could the grown man resist the charms of a 14 year-old nymphet?','https://image.tmdb.org/t/p/w500/lx4TiBA86ukJK2goxN7ZuDguA9f.jpg','2007-01-03',4.8,0),(21613,'The Lost Daughter','en','A woman\'s seaside vacation takes a dark turn when her obsession with a young mother forces her to confront secrets from her past.','https://image.tmdb.org/t/p/w500/t1oLNRFixpFOVsyz1HCqCUW3wiW.jpg','2021-12-16',6.6,0),(21614,'All Quiet on the Western Front','en','A young soldier faces profound disillusionment in the soul-destroying horror of World War I. Together with several other young German soldiers, he experiences the horrors of war, such evil of which he had not conceived of when signing up to fight. They eventually become sad, tormented, and confused of their purpose.','https://image.tmdb.org/t/p/w500/yAU6jklJLUjZot3WyvyJrxVdLKb.jpg','1930-04-29',7.8,0),(21615,'Psycho Goreman','en','Siblings Mimi and Luke unwittingly resurrect an ancient alien overlord. Using a magical amulet, they force the monster to obey their childish whims, and accidentally attract a rogues’ gallery of intergalactic assassins to small-town suburbia.','https://image.tmdb.org/t/p/w500/foQnDv051kQ7satMQkbkPsUxzkD.jpg','2020-10-29',6,0),(21616,'Manchester by the Sea','en','After his older brother passes away, Lee Chandler is forced to return home to care for his 16-year-old nephew. There he is compelled to deal with a tragic past that separated him from his family and the community where he was born and raised.','https://image.tmdb.org/t/p/w500/e8daDzP0vFOnGyKmve95Yv0D0io.jpg','2016-11-18',7.5,0),(21617,'Copshop','en','On the run from a lethal assassin, a wily con artist devises a scheme to hide out inside a small-town police station. However, when the hit man turns up at the precinct, an unsuspecting rookie cop finds herself caught in the crosshairs.','https://image.tmdb.org/t/p/w500/szArp3dQlVajpsqpyPFVAFHFsa3.jpg','2021-09-09',6.2,0),(21618,'Love Hurts','es','Family and friends try to sabotage the budding romance between a young upper class girl and a humble student.','https://image.tmdb.org/t/p/w500/eyhd9wLlyDTGOKl4jmzWy5sa90o.jpg','2002-11-08',7.7,0),(21619,'Hot Fuzz','en','As a former London constable, Nicholas Angel finds it difficult to adapt to his new assignment in the sleepy British village of Sandford. Not only does he miss the excitement of the big city, but he also has a well-meaning oaf for a partner. However, when a series of grisly accidents rocks Sandford, Angel smells something rotten in the idyllic village.','https://image.tmdb.org/t/p/w500/zPib4ukTSdXvHP9pxGkFCe34f3y.jpg','2007-02-14',7.5,0),(21620,'White Boy Rick','en','The story of a teenager, Richard Wershe Jr., who became an undercover informant for the police during the 1980s and was ultimately arrested for drug-trafficking and sentenced to life in prison.','https://image.tmdb.org/t/p/w500/xjW2wgrC2ey0APDELP6NMD8tAq7.jpg','2018-09-14',6.3,0),(21621,'Project Power','en','An ex-soldier, a teen and a cop collide in New Orleans as they hunt for the source behind a dangerous new pill that grants users temporary superpowers.','https://image.tmdb.org/t/p/w500/TnOeov4w0sTtV2gqICqIxVi74V.jpg','2020-08-14',6.5,0),(21622,'American Underdog','en','The true story of Kurt Warner, who went from a stockboy at a grocery store to a two-time NFL MVP, Super Bowl champion, and Hall of Fame quarterback.','https://image.tmdb.org/t/p/w500/u3iXpvLPG4DbmuNY9yPjn1Ei54.jpg','2021-12-25',7.4,0),(21623,'Home Again','en','Life for a single mom in Los Angeles takes an unexpected turn when she allows three young guys to move in with her.','https://image.tmdb.org/t/p/w500/pE4VHzhDZgvbx2QOllaXXPADiW1.jpg','2017-09-07',6.1,0),(21624,'Heist','en','A father is without the means to pay for his daughter\'s medical treatment. As a last resort, he partners with a greedy co-worker to rob a casino. When things go awry they\'re forced to hijack a city bus.','https://image.tmdb.org/t/p/w500/eKdz5i9gbzJthAxUZBBj5SVbzKR.jpg','2015-11-13',6.1,0),(21625,'Burn After Reading','en','When a disc containing memoirs of a former CIA analyst falls into the hands of gym employees, Linda and Chad, they see a chance to make enough money for Linda to have life-changing cosmetic surgery. Predictably, events whirl out of control for the duo, and those in their orbit.','https://image.tmdb.org/t/p/w500/eQfTetzb4DMoI4YnPEcNoUQD63U.jpg','2008-09-05',6.6,0),(21626,'The Name of the Rose','en','14th-century Franciscan monk William of Baskerville and his young novice arrive at a conference to find that several monks have been murdered under mysterious circumstances. To solve the crimes, William must rise up against the Church\'s authority and fight the shadowy conspiracy of monastery monks using only his intelligence – which is considerable.','https://image.tmdb.org/t/p/w500/tjNvWE3XgFEQL3JLbUfkZI5W1uE.jpg','1986-09-24',7.5,0),(21627,'Astro Kid','fr','Upon the destruction of their ship, Willy is separated from his parents. He lands on a wild and unexplored planet and with the help of Buck, a survival robot, he will have to hold until the arrival of a rescue mission.','https://image.tmdb.org/t/p/w500/vwqEIL5SrsZFVvileNe9LuHbJy7.jpg','2019-04-03',7.1,0),(21628,'Sleepless in Seattle','en','When Sam Baldwin\'s wife dies, he is left to bring up his eight-year-old son Jonah alone, and decides to move to Seattle to make a new start. On Christmas Eve, Jonah rings a radio phone-in with his Christmas wish to find a new wife for his dad. Meanwhile in Baltimore, journalist Annie Reed, who is having doubts about her own relationship, is listening in.','https://image.tmdb.org/t/p/w500/iLWsLVrfkFvOXOG9PbUAYg7AK3E.jpg','1993-06-24',6.7,0),(21629,'Miss Congeniality 2: Armed and Fabulous','en','After her triumph at the Miss United States pageant, FBI agent Gracie Hart becomes an overnight sensation -- and the new \"face of the FBI\". But it\'s time to spring into action again when the pageant\'s winner, Cheryl, and emcee, Stan, are abducted.','https://image.tmdb.org/t/p/w500/gcYoIHND3ugn2VH1cNHHNQasEyI.jpg','2005-04-14',5.7,0),(21630,'Prey','de','A hiking trip into the wild turns into a desperate bid for survival for five friends on the run from a mysterious shooter.','https://image.tmdb.org/t/p/w500/6D7nfhHI7b9ZvW3m7wVMtBSbC9U.jpg','2021-09-10',4.7,0),(21631,'Zola','en','A waitress agrees to accompany an exotic dancer, her put-upon boyfriend, and her mysterious and domineering roommate on a road trip to Florida to seek their fortune at a high-end strip club.','https://image.tmdb.org/t/p/w500/bJLCPROp9bmNndurwZpVnOioVpB.jpg','2020-01-24',6.2,0),(21632,'The Break-Up','en','Pushed to the breaking-up point after their latest \'why can\'t you do this one little thing for me?\' argument, Brooke calls it quits with her boyfriend Gary. What follows is a hilarious series of remedies, war tactics, overtures and undermining tricks – all encouraged by the former couple\'s friends and confidantes …and the occasional total stranger! When neither ex is willing to move out of their shared apartment, the only solution is to continue living as hostile roommates until one of them reaches breaking point.','https://image.tmdb.org/t/p/w500/84AuLNXc9sEMXUJ3xAvHhpM3J8u.jpg','2006-06-01',5.8,0),(21633,'Open Season: Scared Silly','en','The humans and animals believe a werewolf is on the loose, and former hunter Shaw uses the opportunity to re-open the season. Boog, Elliot, and Mr. Weenie have to face their fears and find the werewolf to get the season closed permanently.','https://image.tmdb.org/t/p/w500/9r9aJIvLrmilQLUdc3LVPQzgOIb.jpg','2015-12-18',5.9,0),(21634,'Hellraiser III: Hell on Earth','en','Pinhead is trapped in the Pillar of Souls. Fortunately for him it is bought by a young playboy who owns his own nightclub. Pinhead busies himself escaping by getting the playboy to lure victims to his presence so he can use their blood. Once free, he seeks to destroy the puzzle box so he need never return to Hell, but a female reporter is investigating the grisly murders and stands in his way.','https://image.tmdb.org/t/p/w500/eBKrmVD29BQGDlWQJ3rKS8cmPGh.jpg','1992-09-11',5.7,0),(21635,'Twitches','en','Twins separated at birth, Camryn and Alex meet by chance for the first time on their 21st birthday and discover they\'re witches with the power to save their homeland of Coventry from the evil that threatens it. But when Camryn leaves Alex to face the darkness alone, will Coventry be doomed? Or will the sisters multiply their magic by standing together?','https://image.tmdb.org/t/p/w500/oQ2wWWefU2flwuPgdIkLGhPq6Tk.jpg','2005-10-14',6.7,0),(21636,'Man of Tai Chi','en','In Beijing, a young martial artist\'s skill places him in position to experience opportunities and sacrifices.','https://image.tmdb.org/t/p/w500/jXq5Gjy8vc3iifDgtObZ4i6qNe8.jpg','2013-07-04',6,0),(21637,'8 Years','es','How to overcome true love? Jose considers David the man of his life, but when he suddenly breaks up with him after 8 years together, Jose is haunted by memories of their past relationship, which bring home to him that their life together wasn\'t as ideal as he once thought.','https://image.tmdb.org/t/p/w500/h0KwdUYl0VAJalsZ1cnHQv3tlIQ.jpg','2022-09-24',7.7,0),(21638,'Squared Love All Over Again','pl','A celebrity journalist and a down-to-earth teacher find their relationship in rocky waters when a job gets in the way of their new life together.','https://image.tmdb.org/t/p/w500/cjv7khr