ed back to duty by the FBI when a former priest claims to be receiving psychic visions pertaining to a kidnapped agent.','https://image.tmdb.org/t/p/w500/s3x7CZO7gCICKQkA5rSgorkJzYy.jpg','2008-07-24',5.7,0),(21643,'Precious Cargo','en','After a botched heist, Eddie  a murderous crime boss, hunts down the seductive thief Karen who failed him. In order to win back Eddie’s trust, Karen recruits her ex-lover and premier thief Jack to steal a cargo of rare precious gems. But when the job goes down, allegiances are betrayed and lines are crossed as Jack, Karen, and Eddie face off in a fateful showdown.','https://image.tmdb.org/t/p/w500/dOQv2PDBu9bBCZRLeRp6QQYJDr3.jpg','2016-07-15',5.2,0),(21644,'The Woman in the Window','en','An agoraphobic woman living alone in New York begins spying on her new neighbors only to witness a disturbing act of violence.','https://image.tmdb.org/t/p/w500/wcrjc1uwQaqoqtqi67Su4VCOYo0.jpg','2021-05-14',6.1,0),(21645,'Guns Akimbo','en','An ordinary guy suddenly finds himself forced to fight a gladiator-like battle for a dark website that streams the violence for viewers. In order to survive and rescue his kidnapped ex-girlfriend, he must battle Nix, a heavily armed and much more experienced fighter.','https://image.tmdb.org/t/p/w500/2kNnf7BwRCEm4bcFkdiE0T4U25s.jpg','2020-02-27',6.5,0),(21646,'Deadstream','en','A disgraced internet personality attempts to win back his followers by livestreaming one night alone in a haunted house. But when he accidentally pisses off a vengeful spirit, his big comeback event becomes a real-time fight for his life.','https://image.tmdb.org/t/p/w500/5rsS8m61oHTjoTKfDWVMF3OHnww.jpg','2022-10-20',6.4,0),(21647,'Convoy','en','Trucker Rubber Duck and his buddies Pig Pen, Widow Woman and Spider Mike use their CB radios to warn one another of the presence of cops. But conniving Sheriff Wallace is hip to the truckers\' tactics, and begins tricking the drivers through his own CB broadcasts. Facing constant harassment from the