 up on the dinner table. He hatches a plan with Charlotte, a spider that lives in his pen, to ensure that this will never happen.','https://image.tmdb.org/t/p/w500/gqg3ruuEDQ6XmXjFGrTDrk58xJg.jpg','2006-12-07',6.2,0),(21658,'Dredd','en','In the future, America is a dystopian wasteland. The latest scourge is Ma-Ma, a prostitute-turned-drug pusher with a dangerous new drug and aims to take over the city. The only possibility of stopping her is an elite group of urban police called Judges, who combine the duties of judge, jury and executioner to deliver a brutal brand of swift justice. But even the top-ranking Judge, Dredd, discovers that taking down Ma-Ma isn’t as easy as it seems in this explosive adaptation of the hugely popular comic series.','https://image.tmdb.org/t/p/w500/wLx65gtGVnUFCxceHWGszcruCZj.jpg','2012-09-07',6.8,0),(21659,'The Grudge 2','en','A young woman encounters a malevolent supernatural force while searching for her missing sister in Tokyo, a mean high school prank goes horribly wrong, and strange things begin happening in a Chicago apartment building.','https://image.tmdb.org/t/p/w500/gzr7ywaU9mUfASN57FYsKRFb4l0.jpg','2006-10-12',5.5,0),(21660,'Sound of Metal','en','Metal drummer Ruben begins to lose his hearing. When a doctor tells him his condition will worsen, he thinks his career and life is over. His girlfriend Lou checks the former addict into a rehab for the deaf hoping it will prevent a relapse and help him adapt to his new life. After being welcomed and accepted just as he is, Ruben must choose between his new normal and the life he once knew.','https://image.tmdb.org/t/p/w500/3178oOJKKPDeQ2legWQvMPpllv.jpg','2020-11-20',7.8,0),(21661,'The Last Temptation of Christ','en','Jesus, a humble Judean carpenter beginning to see that he is the son of God, is drawn into revolutionary action against the Roman occupiers by Judas -- despite his protestations that love, not violence, is the path to salvation. The burden of being the savior of mankind