 be true. Unfortunately, in order to save himself, he has to figure out which theory it is.','https://image.tmdb.org/t/p/w500/wj0n6gci4EMWRhV9ozCKTgESGdB.jpg','1997-08-08',6.6,0),(21668,'We Need to Talk About Kevin','en','After her son Kevin commits a horrific act, troubled mother Eva reflects on her complicated relationship with her disturbed son as he grew from a toddler into a teenager.','https://image.tmdb.org/t/p/w500/AtdYbs1SqYwFOLyi2v6ldVTawbn.jpg','2011-09-28',7.6,0),(21669,'Little Nicky','en','After the lord of darkness decides he will not cede his throne to any of his three sons, the two most powerful of them escape to Earth to create a kingdom for themselves. This action closes the portal filtering sinful souls to Hell and causes Satan to wither away. He must send his most weak but beloved son, Little Nicky, to Earth to return his brothers to Hell.','https://image.tmdb.org/t/p/w500/AudA8gnTWSBWXBHSBHnr3HHUXXM.jpg','2000-11-10',5.9,0),(21670,'Paranormal Activity: The Ghost Dimension','en','Using a special camera that can see spirits, a family must protect their daughter from an evil entity with a sinister plan.','https://image.tmdb.org/t/p/w500/4R4DWo10V6CGq9wCRYoOubL1w2q.jpg','2015-10-21',5.3,0),(21671,'Frozen','en','When three skiers find themselves stranded on a chair lift at a New England ski resort that has closed for the next week, they are forced to make life or death choices that prove to be more perilous than staying put and freezing to death.','https://image.tmdb.org/t/p/w500/6SjRpaJg43iJnY0jlJ6c61tAKOo.jpg','2010-02-05',6,0),(21672,'Labyrinth','en','When teen Sarah is forced to babysit Toby, her baby stepbrother, she summons Jareth the Goblin King to take him away. When he is actually kidnapped, Sarah is given just thirteen hours to solve a labyrinth and rescue him.','https://image.tmdb.org/t/p/w500/q2GimbyqxCeLkRfSMajtaHdwWg9.jpg','1986-06-27',7.3,0),(21673,'Giant','en','Wealthy rancher Bick Benedict and dirt-poor cowboy Jett Rink both woo Leslie Lynnton, a beautiful young woman from Maryland who is new to Texas. She marries Benedict, but she is shocked by the racial bigotry of the White Texans against the local people of Mexican descent. Rink discovers oil on a small plot of land, and while he uses his vast, new wealth to buy all the land surrounding the Benedict ranch, the Benedict\'s disagreement over prejudice fuels conflict that runs across generations.','https://image.tmdb.org/t/p/w500/adE0ZL4kO6iGtxgfEDqiQ7jGpeG.jpg','1956-11-08',7.6,0),(21674,'Jaws: The Revenge','en','After another deadly shark attack, Ellen Brody decides she has had enough of New England\'s Amity Island and moves to the Caribbean to join her son, Michael, and his family. But a great white shark has followed her there, hungry for more lives.','https://image.tmdb.org/t/p/w500/kGiaOztahZV2x7bil7sbk7fb6ob.jpg','1987-07-17',4.1,0),(21675,'Breakdown','en','When his SUV breaks down on a remote Southwestern road, Jeff Taylor lets his wife, Amy, hitch a ride with a trucker to get help. When she doesn\'t return, Jeff fixes his SUV and tracks down the trucker -- who tells the police he\'s never seen Amy. Johnathan Mostow\'s tense thriller then follows Jeff\'s desperate search for his wife, which eventually uncovers a small town\'s murderous secret.','https://image.tmdb.org/t/p/w500/h6POHvMnoqBVpAFQXCMBoTjru9.jpg','1997-05-02',6.8,0),(21676,'The Tragedy of Macbeth','en','Macbeth, the Thane of Glamis, receives a prophecy from a trio of witches that one day he will become King of Scotland. Consumed by ambition and spurred to action by his wife, Macbeth murders his king and takes the throne for himself.','https://image.tmdb.org/t/p/w500/wzQjzBq1ISZHoDKoAlxSWuiL3hO.jpg','2021-12-05',7,0),(21677,'The Crazies','en','Four friends find themselves trapped in their small hometown after they discover their friends and neighbors going quickly and horrifically insane.','https://image.tmdb.org/t/p/w500/ggtG9DZELyTtM2Y0DRJDOJa5iP8.jpg','2010-02-26',6.2,0),