,'Star Trek V: The Final Frontier','en','The crew of the Federation starship Enterprise is called to Nimbus III, the Planet of Intergalactic Peace. They are to negotiate in a case of kidnapping only to find out that the kidnapper is a relative of Spock. This man is possessed by his life long search for the planet Sha Ka Ree which is supposed to be the source of all life. Together they begin to search for this mysterious planet.','https://image.tmdb.org/t/p/w500/uiXr41VLYsuug3CZbFrKLSNahuZ.jpg','1989-06-09',5.7,0),(21684,'Jarhead: Law of Return','en','Major Ronan Jackson, an accomplished fighter pilot for the Israel Defense Forces and son of a U.S. Senator, is shot down while flying through Syrian airspace. After miraculously surviving the crash, Jackson is taken captive by a group of Hezbollah militiamen. A squad of elite soldiers, led by Gunnery Sergeant Dave Torres, risk their own lives in the hopes of saving an ally they\'ve never met.','https://image.tmdb.org/t/p/w500/6LlqyjAik3Kh68QQ9AchSJEF0Z5.jpg','2019-10-01',6.5,0),(21685,'Annette','en','The story of Henry, a stand-up comedian with a fierce sense of humour and Ann, a singer of international renown. In the spotlight, they are the perfect couple, healthy, happy, and glamourous. The birth of their first child, Annette, a mysterious girl with an exceptional destiny, will change their lives.','https://image.tmdb.org/t/p/w500/4FTnypxpGltJdIARrfFsP31pGTp.jpg','2021-07-06',6.8,0),(21686,'Elizabeth: The Golden Age','en','When Queen Elizabeth\'s reign is threatened by ruthless familial betrayal and Spain\'s invading army, she and her shrewd adviser must act to safeguard the lives of her people.','https://image.tmdb.org/t/p/w500/3bL6lLd6cyQ4JNT4ucqm4PICIVs.jpg','2007-09-09',6.7,0),(21687,'El test','es','What would you choose: be a little rich now, or wait ten years and be filthy rich? Could you wait this long? Why? And most importantly, could you come to terms with your life partner? The protagonists will have to choose between the possibility of opting for 100,000 euros at the present time or obtaining a million euros after ten years... Adaptation of the work by Jordi Vallejo.','https://image.tmdb.org/t/p/w500/r5DbPQNmPJYYJC0nv6di13Y2dB3.jpg','2022-09-02',6.2,0),(21688,'One Missed Call','en','Several people start receiving voice-mails from their future selves -- messages which include the date, time, and some of the details of their deaths.','https://image.tmdb.org/t/p/w500/9pIvQaQV0sMHx7d3Ys9qTK9YqTZ.jpg','2008-01-04',5.5,0),(21689,'The Lost Prince','fr','Djibi lives alone with Sofia, his 8-year-old daughter. Every night, he invents a story to put him to sleep. When Sofia falls asleep, these extraordinary stories come to life somewhere in an imaginary world inhabited by knights, pirates and other dragons. In this world that belongs only to them, Sofia is always the princess to save, and the brave Prince is none other than Djibi himself.  But 3 years later, the entry of Sofia to the college will mark the end of her childhood. To the despair of her father, she no longer needs her stories at night. On the one hand, Djibi will have to accept that his daughter will grow up and move away from him. On the other hand, in the World of Stories, the Prince will have to face the most epic of all his adventures. Find your destiny in a world where it no longer has a place.','https://image.tmdb.org/t/p/w500/iFcSfoMu9hQIX4t0CxIkDJKgIES.jpg','2020-02-12',5.8,0),(21690,'Bandit','en','After escaping a Michigan prison, a charming career criminal assumes a new identity in Canada and goes on to rob a record 59 banks and jewellery stores while being hunted by a rogue task force. Based on the story of The Flying Bandit.','https://image.tmdb.org/t/p/w500/yph9PAbmjYPvyvbeZvdYIhCZHEu.jpg','2022-09-23',6.8,0),(21691,'Ladyhawke','en','Captain Etienne Navarre is a man on whose shoulders lies a cruel curse. Punished for loving each other, Navarre must become a wolf by night whilst his lover, Lady Isabeau, takes the form of a hawk by day. Together, with the thief Philippe Gaston, they must try to overthrow the corrupt Bishop and in doing so break the spell.','https://image.tmdb.org/t/p/w500/vJA2Fhw2uBMiVFdBde2kH7kZ2gw.jpg','1985-03-27',7,0),(21692,'Feel the Beat','en','After failing to make it on Broadway, April returns to her hometown and reluctantly begins training a misfit group of young dancers for a competition.','https://image.tmdb.org/t/p/w500/Af2jt7m9GLFpR4V11xOsFmT8OKD.jpg','2020-06-19',7.7,0),(21693,'The Edge','en','The plane carrying wealthy Charles Morse crashes down in the Alaskan wilderness. Together with the two other passengers, photographer Robert and assistant Stephen, Charles devises a plan to help them reach civilization. However, his biggest obstacle might not be the elements, or even the Kodiak bear stalking them -- it could be Robert, whom Charles suspects is having an affair with his wife and would not mind seeing him dead.','https://image.tmdb.org/t/p/w500/mwzaD2KmWzGUyVJtcUUilH9EbtL.jpg','1997-09-06',6.8,0),(21694,'Nosferatu','de','The mysterious Count Orlok summons Thomas Hutter to his remote Transylvanian castle in the mountains. The eerie Orlok seeks to buy a house near Hutter and his wife, Ellen. After Orlok reveals his vampire nature, Hutter struggles to escape the castle, knowing that Ellen is in grave danger','https://image.tmdb.org/t/p/w500/zx24O7VAs6NbJhiIrUhWysAiHS0.jpg','1922-02-16',7.7,0),(21695,'Flowers in the Attic','en','After the sudden death of their father, four children face cruel treatment from their ruthless grandmother.','https://image.tmdb.org/t/p/w500/owzDkkxL2DogC2mq1fgIvrlDcux.jpg','2014-01-18',6.6,0),(21696,'George of the Jungle 2','en','George and Ursula now have a son, George Junior, so Ursula\'s mother arrives to try and take them back to \"civilization\".','https://image.tmdb.org/t/p/w500/hMJbCWC9EpkVNKM3KaIOElCQIrT.jpg','2003-08-18',4.4,0),(21697,'Police Story','cn','Officer Chan Ka Kui manages to put a major Hong Kong drug dealer behind the bars practically alone, after a shooting and an impressive chase inside a slum. Now, he must protect the boss\' secretary, Selina, who will testify against the gangster in court.','https://image.tmdb.org/t/p/w500/q8YfsyX59OmoSDirXT4CyThwN5f.jpg','1985-12-14',7.5,0),(21698,'Trouble with the Curve','en','Slowed by age and failing eyesight, crack baseball scout Gus Lobel takes his grown daughter along as he checks out the final prospect of his career. Along the way, the two renew their bond, and she catches the eye of a young player-turned-scout.','https://image.tmdb.org/t/p/w500/zLZQVmxOj5kICbS5Pq7rB1cbPvP.jpg','2012-09-21',6.9,0),(21699,'The Darjeeling Limited','en','Three American brothers who have not spoken to each other in a year set off on a train voyage across India with a plan to find themselves and bond with each other -- to become brothers again like they used to be. Their \"spiritual quest\", however, veers rapidly off-course (due to events involving over-the-counter pain killers, Indian cough syrup, and pepper spray).','https://image.tmdb.org/t/p/w500/oSW5OVXTulaIXcoNwJAp5YEKpbP.jpg','2007-09-07',7.2,0),(21700,'Starship Troopers 2: Hero of the Federation','en','In the sequel to Paul Verhoeven\'s loved/reviled sci-fi film, a group of troopers taking refuge in an abandoned outpost after fighting alien bugs, failing to realize that more danger lays in wait.','https://image.tmdb.org/t/p/w500/9iqrqOjLaFcGNnSQlJxYLfgrhqn.jpg','2004-04-20',4.3,0),(21701,'Wonka','en','A young Willy Wonka embarks on a mission to spread joy through his chocolate, which quickly becomes a phenomenon.','https://image.tmdb.org/t/p/w500/c5tzazjnSFpFamcS8Whyi5yWx69.jpg','2023-12-13',0,0),(21702,'Red Lights','en','Two investigators of paranormal hoaxes, the veteran Dr. Margaret Matheson and her young assistant, Tom Buckley, study the most varied metaphysical phenomena with the aim of proving their fraudulent origins. Simon Silver, a legendary blind psychic, r