er the Sea\' .','https://image.tmdb.org/t/p/w500/lqLIpwISJEvERlS5fSWe8xbQDFf.jpg','1961-12-19',6.5,0),(21707,'Ibiza Blue','es','August 2020. The lives of three young professionals intersect in the post-pandemic lock-down Ibiza where they will try to overcome their personal tragedies, rediscover themselves and move on.','https://image.tmdb.org/t/p/w500/rr7lUIQ6tysyvJx14d4pG0GNrWT.jpg','2023-02-10',2,0),(21708,'Escape from New York','en','In the future, crime is out of control and New York City\'s Manhattan is a maximum security prison. Grabbing a bargaining chip right out of the air, convicts bring down the President\'s plane in bad old Gotham. Gruff Snake Plissken, a one-eyed lone warrior new to prison life, is coerced into bringing the President, and his cargo, out of this land of undesirables.','https://image.tmdb.org/t/p/w500/bOXk4mF2TjMJVq8DZYUtblKOR92.jpg','1981-06-26',7.1,0),(21709,'Deep Blue Sea 2','en','When shark conservationist Dr. Misty Calhoun is invited to consult on a top-secret project run by pharmaceutical billionaire Carl Durant, she is shocked to learn that the company is using unpredictable and highly aggressive bull sharks as its test subjects, which soon break loose and cause havoc.','https://image.tmdb.org/t/p/w500/xqjAHXMJLORx9vVsCTJ6ZPJcr3D.jpg','2018-04-17',5.2,0),(21710,'Monster Family','en','The Wishbone family are far from happy. In an attempt to reconnect as a family, they plan a fun night out. However, the plan backfires when they are cursed and all turned into Monsters.','https://image.tmdb.org/t/p/w500/gjDbd43e7o2Ssn7P1l50Bv0rtIl.jpg','2017-08-24',6,0),(21711,'New Nightmare','en','A demonic force has chosen Freddy Krueger as its portal to the real world. Can Heather Langenkamp play the part of Nancy one last time and trap the evil trying to enter our world?','https://image.tmdb.org/t/p/w500/eN3UZUYapJ2CJCD9dN0LUZLouKa.jpg','1994-10-13',6.4,0),(21712,'Tarzan & Jane','en','With the first anniversary of her wedding to Tarzan beckoning, Jane ponders how to make it the perfect English celebration.','https://image.tmdb.org/t/p/w500/esRxshmD2BY1UPkiUHt7Gn2mksl.jpg','2002-06-24',6,0),(21713,'Buried','en','Paul is a U.S. truck driver working in Iraq. After an attack by a group of Iraqis he wakes to find he is buried alive inside a coffin. With only a lighter and a cell phone it\'s a race against time to escape this claustrophobic death trap.','https://image.tmdb.org/t/p/w500/splPNB0vAoNlb8l5WYxz2E3FK2G.jpg','2010-09-24',6.6,0),(21714,'Monica, O My Darling','hi','A slick robotics expert joins a murderous plot after a passionate affair takes a sudden turn, but nothing — not even death — is what it seems to be.','https://image.tmdb.org/t/p/w500/xEksr0T34utTkeg0DB1Au4M0jto.jpg','2022-11-11',7.3,0),(21715,'Lost in Translation','en','Two lost souls visiting Tokyo -- the young, neglected wife of a photographer and a washed-up movie star shooting a TV commercial -- find an odd solace and pensive freedom to be real in each other\'s company, away from their lives in America.','https://image.tmdb.org/t/p/w500/wkSzJs7oMf8MIr9CQVICsvRfwA7.jpg','2003-09-18',7.4,0),(21716,'Barbie & Her Sisters in a Puppy Chase','en','Barbie and her sisters go to an island paradise for a dance competition, but they must work together as a team to find their pets after their furry friends go missing at a horse festival.','https://image.tmdb.org/t/p/w500/i5aTj6smR8H6wHQ3gd0CqxrHXaA.jpg','2016-10-04',6.9,0),(21717,'Road House','en','The Double Deuce is the meanest, loudest and rowdiest bar south of the Mason-Dixon Line, and Dalton has been hired to clean it up. He might not look like much, but the Ph.D.-educated bouncer proves he\'s more than capable -- busting the heads of troublemakers and turning the roadhouse into a jumping hot-spot. But Dalton\'s romance with the gorgeous Dr. Clay puts him on the bad side of cutthroat local big shot Brad Wesley.','https://image.tmdb.org/t/p/w500/60VHW8heV11uLSCnkjk6iGRQatA.jpg','1989-05-19',6.6,0),(21718,'I Am All Girls','en','A special crimes investigator forms an unlikely bond with a serial killer to bring down a global child sex trafficking syndicate.','https://image.tmdb.org/t/p/w500/voQLcqp0ehF3md93hMpELCRxTDv.jpg','2021-05-14',6.7,0),(21719,'Act of Valor','en','When a covert mission to rescue a kidnapped CIA operative uncovers a chilling plot, an elite, highly trained U.S. SEAL team speeds to hotspots around the globe, racing against the clock to stop a deadly terrorist attack.','https://image.tmdb.org/t/p/w500/1Xcd5ci69pVXMPP02DU11Ffq0yY.jpg','2012-02-24',6.5,0),(21720,'Batman: Gotham Knight','en','A collection of key events mark Bruce Wayne\'s life as he journeys from beginner to Dark Knight.','https://image.tmdb.org/t/p/w500/weCFATAA8ntBRRgLkIcbz4EFsLl.jpg','2008-07-08',6.7,0),(21721,'Oldboy','en','An everyday man has only three and a half days and limited resources to discover why he was imprisoned in a nondescript room for 20 years without any explanation.','https://image.tmdb.org/t/p/w500/iX93YdBrZA1EpGbphmjf4ARj1Za.jpg','2013-11-14',5.9,0),(21722,'Crash','en','After getting into a serious car accident, a TV director discovers an underground sub-culture of scarred, omnisexual car-crash victims who use car accidents and the raw sexual energy they produce to try to rejuvenate his sex life with his wife.','https://image.tmdb.org/t/p/w500/gpai5oUFyFGLHOCsYTvVMqlbY7A.jpg','1996-07-17',6.5,0),(21723,'Bloodthirsty','en','When indie singer Grey struggles to write her sophomore album, she teams up with a mysterious producer at his secluded cabin. Though their bond strengthens her music, it also starts to irreparably alter Grey’s body and mind.','https://image.tmdb.org/t/p/w500/49a2fQEFO2R190Ng5ksJedRJun6.jpg','2021-04-23',5.4,0),(21724,'Roman Holiday','en','Overwhelmed by her suffocating schedule, touring European princess Ann takes off for a night while in Rome. When a sedative she took from her doctor kicks in, however, she falls asleep on a park bench and 