he key to thwarting the Fatal Five? An epic battle against ultimate evil awaits!','https://image.tmdb.org/t/p/w500/9F4yd1lnTKFHZkme1nuPWmH1hbl.jpg','2019-03-29',6.8,0),(21729,'Anne of Green Gables','en','At the turn of the century on Prince Edward Island, Matthew Cuthbert and his sister Marilla decide to take on an orphan boy as help for their farm. But they get an unexpected jolt when they\'re mistakenly sent a girl instead: Anne Shirley.','https://image.tmdb.org/t/p/w500/wuF8aapqbDPFkoWbwI5LWfDXpVq.jpg','1985-12-01',8.1,0),(21730,'LEGO DC Comics Super Heroes: Justice League - Attack of the Legion of Doom!','en','Crime is on the run as the newly formed Justice League keeps Metropolis safe and this makes evil genius Lex Luthor very unhappy. Together with Black Manta, Sinestro and a gang of ruthless recruits, Lex builds his own league and declares them the Legion of Doom. With this super powered team of terror and a plan to attack the top-secret government site, Area 52, can Lex finally be on the verge of victory? Sound the alarm and get ready for the bricks to fly when Superman, Batman, Wonder Woman and the rest of the Justice League face off against the world\'s greatest Super-Villains! It\'s the next all-new original movie from LEGO® and DC Comics.','https://image.tmdb.org/t/p/w500/sQktXbJSac5xkGDo2sXkEvNRqAb.jpg','2015-08-25',7,0),(21731,'Corro da te','it','Gianni is a serial seducer but his life is destined to change when he meets Chiara, a beautiful woman who has had an accident and is paraplegic.','https://image.tmdb.org/t/p/w500/vWgcIHKARoGFtbEPP9Ut7y2fmoP.jpg','2022-03-17',6.9,0),(21732,'Teenage Mutant Ninja Turtles III','en','The four turtles travel back in time to the days of the legendary and deadly samurai in ancient Japan, where they train to perfect the art of becoming one. The turtles also assist a small village in an uprising.','https://image.tmdb.org/t/p/w500/fwX5RdPDBFsbEAXc46DrvRz5Bca.jpg','1993-03-17',5.4,0),(21733,'Planes, Trains and Automobiles','en','An irritable marketing executive, Neal Page, is heading home to Chicago for Thanksgiving when a number of delays force him to travel with a well meaning but overbearing shower ring curtain salesman, Del Griffith.','https://image.tmdb.org/t/p/w500/3RSucVsX96Ste8WDJfZP1hbNGqQ.jpg','1987-11-26',7.2,0),(21734,'Tales from the Crypt: Demon Knight','en','Ex-soldier Frank Brayker is the guardian of an ancient key that can unlock tremendous evil; the sinister Collector is a demon who wants the key so he can initiate the apocalypse. On the run from wicked mercenaries for almost 90 years, Brayker finally stops in at a boarding house in New Mexico where — with the help of its residents — he plans to face off against the Collector and his band of ghouls, preventing them from ever seizing the key.','https://image.tmdb.org/t/p/w500/1TekTWa1htkb554KDplTXskQupo.jpg','1995-01-13',6.8,0),(21735,'Armour of God','cn','Jackie Chan stars as Asian Hawk, an Indiana Jones-style adventurer looking to make a fortune in exotic antiquities. After Hawk discovers a mysterious sword in Africa, a band of Satan-worshipping monks kidnap his ex-girlfriend Lorelei, demanding the sword as ransom as well as other pieces of the legendary Armour of God - a magical outfit dating back to the Crusades.','https://image.tmdb.org/t/p/w500/7H0Qp0EqFdBIChuXrR4kEyKZyzk.jpg','1986-08-16',7,0),(21736,'Ultimate Avengers: The Movie','en','When a nuclear missile was fired at Washington in 1945, Captain America managed to detonate it in the upper atmosphere. But then he fell miles into the icy depths of the North Atlantic, where he remained lost for over sixty years. But now, with the world facing the very same evil, Captain America must rise again as our last hope for survival.','https://image.tmdb.org/t/p/w500/fKQqZEDmvKMCXEQztvMJHGou9dO.jpg','2006-02-21',6.8,0),(21737,'DOA: Dead or Alive','en','Four beautiful rivals at an invitation-only martial-arts tournament join forces against a sinister threat. Princess Kasumi is an aristocratic warrior trained by martial-arts masters. Tina Armstrong is a wrestling superstar. Helena Douglas is an athlete with a tragic past. Christie Allen earns her keep as a thief and an assassin-for-hire.','https://image.tmdb.org/t/p/w500/lZ6vZka2M0jtH1khYWa8j73E275.jpg','2006-09-07',5.2,0),(21738,'The Little Prince(ss)','en','When Gabriel, a 7-year-old Chinese kid who loves ballet, becomes friends with Rob, another Chinese kid from school, Rob’s dad gets suspicious about Gabriel\'s feminine behavior and decides to intervene.','https://image.tmdb.org/t/p/w500/4O65UNeSnWqRcuTUFcy75PluCzz.jpg','2021-05-28',7.2,0),(21739,'The Day','en','Open war against humanity rages. For five survivors – lost and on the run – the pursuit is relentless, the bullets are dwindling and the battle is everywhere. This is a 24-hour look into their lives.','https://image.tmdb.org/t/p/w500/zNFCkFmgI4Dnv3UpC0lLM7jWhYU.jpg','2011-09-15',5.2,0),(21740,'My Cousin Vinny','en','Two carefree pals traveling through Alabama are mistakenly arrested, and charged with murder. Fortunately, one of them has a cousin who\'s a lawyer - Vincent Gambini, a former auto mechanic from Brooklyn who just passed his bar exam after his sixth try. When he arrives with his leather-clad girlfriend, to try his first case, it\'s a real shock - for him and the Deep South!','https://image.tmdb.org/t/p/w500/iwSURa8nS2ujwrU3s1lfxxX7voH.jpg','1992-03-13',7.5,0),(21741,'Shock Wave','cn','When a terrorist who specializes in explosives takes hold of an underground tunnel, he threatens to kill hostages if his demands are not met.','https://image.tmdb.org/t/p/w500/l4G4M6V9UrNRdbcsbnMmEZUyBGw.jpg','2017-04-20',6.8,0),(21742,'Staying Alive','en','It\'s five years later and Tony Manero\'s Saturday Night Fever is still burning. Now he\'s strutting toward his biggest challenger yet - making it as a dancer on the Broadway stage.','https://image.tmdb.org/t/p/w500/4iie1EFRkM6ULQYUxRgghQ3AQRm.jpg','1983-07-11',5.7,0),(21743,'Hang \'em High','en','Marshall Jed Cooper survives a hanging, vowing revenge on the lynch mob that left him dangling. To carry out his oath for vengeance, he returns to his former job as a lawman. Before long, he\'s caught up with the nine men on his hit list and starts dispensing his own brand of Wild West justice.','https://image.tmdb.org/t/p/w500/by8sSnLtthxnrhH2ZMdC41l9YfD.jpg','1968-07-31',6.8,0),(21744,'Blade','en','','https://image.tmdb.org/t/p/w500/fKqA4rgVJwrM7Gb3tQ9TGHnu8Tr.jpg','2024-09-04',0,0),(21745,'Eli','en','A boy named Eli with a rare autoimmune disorder is confined to a special experimental clinic for his treatment. He soon begins experiencing supernatural forces, turning the supposedly safe facility into a haunted prison for him and his fellow patients.','https://image.tmdb.org/t/p/w500/bIID8uZTYNnSMfWwaIluRTzaZQL.jpg','2019-10-18',6,0),(21746,'The Count of Monte-Cristo','en','A TV adaptation of the classic Alexandre Dumas novel. Edmond Dantes is falsely accused by those jealous of his good fortune, and is sentenced to spend the rest of his life in the notorious island prison, Chateau d\'If. While imprisoned, he meets the Abbe Faria, a fellow prisoner whom everyone believes to be mad. The Abbe tells Edmond of a fantastic treasure hidden away on a tiny island, that only he knows the location of. After many years in prison, the old Abbe dies, and Edmond escapes disguised as the dead body. Now free, Edmond must find the treasure the Abbe told him of, so he can use the new-found wealth to exact revenge on those who have wronged him.','https://image.tmdb.org/t/p/w500/1sU6nwIgHCJo96xsXPuI7oAuq7a.jpg','1975-01-10',6.7,0),(21747,'Blue Velvet','en','The discovery of a severed human ear found in a field leads a young man on an investigation related to a beautiful, mysterious nightclub singer and a group of criminals who have kidnapped her child.','https://image.tmdb.org/t/p/w500/7hlgzJXLgyECS1mk3LSN3E72l5N.jpg','1986-01-01',7.6,0),(21748,'Charlie St. Cloud','en','Accomplished sailor Charlie St. Cloud has the adoration of his mother Claire and his little brother Sam, as well as a college scholarship that will lead him far from his sleepy Pacific Northwest hometown. But his bright future is cut short when a tragedy strikes and takes his dreams with it. After his high-school classmate Tess returns home unexpectedly, Charlie grows torn between honoring a promise he made four years earlier and moving forward with newfound love. And as he finds the courage to let go of the past for good, Charlie discovers the soul most worth saving is his own.','https://image.tmdb.org/t/p/w500/r4XSrs6N086EU8CNm339dHRPhZg.jpg','2010-07-30',7,0),(21749,'Rosario Tijeras','es','Rosario Tijeras has been abused by men all her life, initially by her stepfather. Years later, she works as a paid assassin, seducing men and killing them when they least expect it. She meets Emilio, a wealthy womanizer, and his best friend, Antonio, at a nightclub, and starts an affair with Emilio despite Antonio\'s growing feelings for her. But circumstances bring her closer to Antonio, until her past catches up with her in a devastating way.','https://image.tmdb.org/t/p/w500/eRD2E8EvX1tyysTdgQrmyWtDjJZ.jpg','2005-08-12',6.2,0),(21750,'Stampede','fr','After a difficult separation, Serge Jr. takes his daughter Lily, 9, on a truck ride across Canada. They head to Alberta and its legendary Badlands World’s Best Truck Rodeo, a race Lily and him have been dreaming about. On the road, under his daughter’s increasingly worried gaze, Serge will eventually need to face the music.','https://image.tmdb.org/t/p/w500/ks7O8Iwkwh1EkfToUNebmA65QYb.jpg','2022-12-02',0,0),(21751,'Sunset Boulevard','en','A hack screenwriter writes a screenplay for a former silent film star who has faded into Hollywood obscurity.','https://image.tmdb.org/t/p/w500/sC4Dpmn87oz9AuxZ15Lmip0Ftgr.jpg','1950-08-10',8.4,0),(21752,'Kidnap','en','A mother (in her Minivan) stops at nothing to recover her kidnapped son.','https://image.tmdb.org/t/p/w500/fwdOX3PEZlOLXr9SMpgRnSmTVFp.jpg','2017-06-16',6.2,0),(21753,'Swingers','nl','Despite Diana\'s insecure nature, she and her husband Julian agree with the idea to sexually experiment with another couple. They put out an ad on the net to which the well experienced Alex and Timo react. We follow Diana and Julian as they prepare for the arrival of Alex and Timo, who they have invited to their home for the weekend. Diana is nervous. As soon as she is confronted with the self-confident and ravishingly sexy Alex, her insecurity increases even more. Timo seems disinterested, a sharp contrast to the boyish excitement of Julian. But as night falls and their sexual exploration begins, we notice Timo may not be as casual as he initially seemed and Diana on the other hand contains hidden strength. And so we realize there\'s more to \'Swingers\' than just sex. Swingers: could your relationship stand the test?','https://image.tmdb.org/t/p/w500/hBpXnx3oalanROIw9h8DDTVIF6I.jpg','2002-10-01',6,0),(21754,'Jack Mimoun & the Secrets of Val Verde','fr','Two years after surviving alone on the hostile island of Val Verde, Jack Mimoun has become an adventure star. The book recounting his experience is a bestseller and his television show breaks audience records. He is then approached by the mysterious Aurélie Diaz who will bring Jack Mimoun back to Val Verde to train him in search of the legendary sword of the pirate La Buse. Accompanied by Bruno Quézac, the ambitious but reckless manager of Jack, and Jean-Marc Bastos, a mercenary as disturbed as he is unpredictable, our adventurers will embark on an incredible treasure hunt through the jungle of the island of thousand dangers.','https://image.tmdb.org/t/p/w500/vWx3Hi7DZ7VWyjWVf9gySG6Lbq4.jpg','2022-10-12',5.5,0),(21755,'Flight of the Phoenix','en','When an oil rig in the Gobi Desert of Mongolia proves unproductive, an aircraft crew are sent to shut the operation down and fly them out. On the flight out over the desert on the way to Beijing, Capt. Frank Towns and co-pilot A.J. are unable to keep their cargo plane, a C-119 Flying Boxcar, in the air when a violent sandstorm strikes. Crash-landing in a remote uncharted part of the desert, the two pilots and their passengers -- a crew of oil workers and a drifter -- must work together to survive by rebuilding the aircraft. Soon, low supplies and a band of merciless smugglers add even greater urgency to their task.','https://image.tmdb.org/t/p/w500/pcj6unMsKCw0ogWFlUXmbc9gKap.jpg','2004-12-17',6,0),(21756,'The Spy Who Loved Me','en','Russian and British submarines with nuclear missiles on board both vanish from sight without a trace. England and Russia both blame each other as James Bond tries to solve the riddle of the disappearing ships. But the KGB also has an agent on the case.','https://image.tmdb.org/t/p/w500/3ZxHKFxMYvAko680DsRgAZKWcLi.jpg','1977-07-07',6.8,0),(21757,'The November Man','en','An ex-CIA operative is brought back in on a very personal mission and finds himself pitted against his former pupil in a deadly game involving high level CIA officials and the Russian president-elect.','https://image.tmdb.org/t/p/w500/4ejNFbCgLMDAuy7jFQmc7cr6UAW.jpg','2014-08-27',6.1,0),(21758,'Alien Abduction','en','A vacationing family encounters an alien threat in this pulse-pounding thriller based on the real-life Brown Mountain Lights phenomenon in North Carolina.','https://image.tmdb.org/t/p/w500/pe9mSStpQC2doKtYY3VDJdBEBHr.jpg','2014-04-04',5.8,0),(21759,'Captain America','en','During World War II, a brave, patriotic American Soldier undergoes experiments to become a new supersoldier, \"Captain America\". Racing to Germany to sabotage the rockets of Nazi baddie \"Red Skull\", Captain America winds up frozen until the 1990s. He reawakens to find that the Red Skull has changed identities and is now planning to kidnap the President of the United States.','https://image.tmdb.org/t/p/w500/lvHr3y3g63hrpXI3pSCLF62tRSZ.jpg','1990-12-14',4.6,0),(21760,'Scooby-Doo! and the Curse of the 13th Ghost','en','Mystery Inc. withdraws from solving crimes after botching a case. When Vincent Van Ghoul contacts the gang about an unfinished investigation from Daphne, Shaggy and Scooby\'s past, the gang springs into action to finish the job that involves catching the 13th Ghost that escaped from the Chest of Demons and is still at large.','https://image.tmdb.org/t/p/w500/hKxlzUtwyEMZDmj58ijQqr5PoZn.jpg','2019-02-05',8,0),(21761,'Ida Red','en','Ida Red may not survive her 20-year prison sentence for armed robbery. She turns to her son, Wyatt, for one last job and a chance to regain her freedom.','https://image.tmdb.org/t/p/w500/etMxKseW67499tUJonLNHXTF538.jpg','2021-11-05',6.2,0),(21762,'Leprechaun 3','en','It was a normal night in Las Vegas, Nevada, all the lights were flashing brightly, until a man with one hand, one eye, and one leg walks into a pawn shop with a statue of a hideous looking Leprechaun. The owner claims it\'s a good luck charm. The statue also wore a medallion around it\'s neck. The careless pawn shop owner took off the medallion setting the Leprechaun free...','https://image.tmdb.org/t/p/w500/z9NT2smK66pYOjBtmZuKFFTZ478.jpg','1995-07-04',5.9,0),(21763,'Ip Man 4: The Finale','cn','Following the death of his wife, Ip Man travels to San Francisco to ease tensions between the local kung fu masters and his star student, Bruce Lee, while searching for a better future for his son.','https://image.tmdb.org/t/p/w500/b5cz6BoyHrgBnhfDHOW5hXRWbln.jpg','2019-12-19',7.2,0),(21764,'Doom','en','A team of space marines known as the Rapid Response Tactical Squad, led by Sarge, is sent to a science facility on Mars after somebody reports a security breach. There, they learn that the alert came after a test subject, a mass murderer purposefully injected with alien DNA, broke free and began killing people. Dr. Grimm, who is related to team member Reaper, informs them all that the chromosome can mutate humans into monsters -- and is highly infectious.','https://image.tmdb.org/t/p/w500/y50lH061yWOvEstoZRn7lYs0huk.jpg','2005-10-20',5.1,0),(21765,'Wild Wild West','en','Legless Southern inventor Dr. Arliss Loveless plans to rekindle the Civil War by assassinating President U.S. Grant. Only two men can stop him: gunfighter James West and master-of-disguise and inventor Artemus Gordon. The two must team up to thwart Loveless\' plans.','https://image.tmdb.org/t/p/w500/1AUzpDzJSecEBIgwUIPzL5KMuTQ.jpg','1999-06-29',5.3,0),(21766,'iMordecai','en','A special story of an aging father and his relationship with his son.','https://image.tmdb.org/t/p/w500/tQXiwirjupuJ6MA2Aj4aQBrVlY6.jpg','2023-02-10',2,0),(21767,'Lazarus','en','After a man is revived from death by murder, he finds that he has otherworldly powers to help avenge the crime ring out to destroy him and his city.','https://image.tmdb.org/t/p/w500/5hEH6Yabe2U8dBnCM5ePX9dDH3n.jpg','2021-04-24',4.3,0),(21768,'The Royal Tenenbaums','en','Royal Tenenbaum and his wife Etheline had three children and then they separated. All three children are extraordinary --- all geniuses. Virtually all memory of the brilliance of the young Tenenbaums was subsequently erased by two decades of betrayal, failure, and disaster. Most of this was generally considered to be their father\'s fault. \"The Royal Tenenbaums\" is the story of the family\'s sudden, unexpected reunion one recent winter.','https://image.tmdb.org/t/p/w500/syaECBy6irxSgeF0m5ltGPNTWXL.jpg','2001-10-05',7.5,0),(21769,'Before Sunset','en','Nine years later, Jesse travels across Europe giving readings from a book he wrote about the night he spent in Vienna with Celine. After his reading in Paris, Celine finds him, and they spend part of the day together before Jesse has to again leave for a flight. They are both in relationships now, and Jesse has a son, but as their strong feelings for each other start to return, both confess a longing for more.','https://image.tmdb.org/t/p/w500/gycdE1ARByGQcK4fYR2mgpU6OO.jpg','2004-02-10',7.8,0),(21770,'Minuscule: Valley of the Lost Ants','fr','In a peaceful little clearing, the remains of a hastily abandoned picnic sparks a battle between two tribes of ants. A bold young ladybug finds himself caught in the middle. He befriends the leader of the black ants, Mandible, and helps him save the anthill from the assault of the terrible red ant warriors, led by the fearful Butor. A fantastic journey at ground level.','https://image.tmdb.org/t/p/w500/tk4kHoeXx0i7TROwiOrcSEtHOEl.jpg','2013-11-17',6.9,0),(21771,'G.I. Jane','en','In response to political pressure from Senator Lillian DeHaven, the U.S. Navy begins a program that would allow for the eventual integration of women into its services. The program begins with a single trial candidate, Lieutenant Jordan O\'Neil, who is chosen specifically for her femininity. O\'Neil enters the grueling training program under the command of Master Chief John James Urgayle, who unfairly pushes O\'Neil until her determination wins his respect.','https://image.tmdb.org/t/p/w500/6yBgZJYqaR4XkxwjsB9tS4GK1ZN.jpg','1997-08-19',6.4,0),(21772,'The Girl with the Dragon Tattoo','sv','Swedish thriller based on Stieg Larsson\'s novel about a male journalist and a young female hacker. In the opening of the movie, Mikael Blomkvist, a middle-aged publisher for the magazine Millennium, loses a libel case brought by corrupt Swedish industrialist Hans-Erik Wennerström. Nevertheless, he is hired by Henrik Vanger in order to solve a cold case, the disappearance of Vanger\'s niece','https://image.tmdb.org/t/p/w500/r2pFUXKK20KD9RE3yybpQsNynRE.jpg','2009-02-27',7.5,0),(21773,'Ammonite','en','In 1840s England, palaeontologist Mary Anning and a young woman sent by her husband to convalesce by the sea develop an intense relationship. Despite the chasm between their social spheres and personalities, Mary and Charlotte discover they can each offer what the other has been searching for: the realisation that they are not alone. It is the beginning of a passionate and all-consuming love affair that will defy all social bounds and alter the course of both lives irrevocably.','https://image.tmdb.org/t/p/w500/5lx4pUHWZoOKJWsVsvurRRNW9FK.jpg','2020-11-13',7.1,0),(21774,'Like a Boss','en','Two female friends with very different ideals decide to start a beauty company together. One is more practical, while the other wants to earn her fortune and live a lavish lifestyle.','https://image.tmdb.org/t/p/w500/yce0CZPWd0GGudksRJi8p4gDj1M.jpg','2020-01-09',6.3,0),(21775,'Eastern Promises','en','A Russian teenager, living in London, dies during childbirth but leaves clues to a midwife in her journal, that could tie her child to a rape involving a violent Russian mob family.','https://image.tmdb.org/t/p/w500/dpiJWb4NrWgcOg2rusuLhDM0hTm.jpg','2007-09-14',7.4,0),(21776,'Modern Times','en','The Tramp struggles to live in modern industrial society with the help of a young homeless woman.','https://image.tmdb.org/t/p/w500/9xeglIbChLIe0P4fTQNAdlG2v0C.jpg','1936-02-05',8.3,0),(21777,'Two Weeks Notice','en','Dedicated environmental lawyer Lucy Kelson goes to work for billionaire George Wade as part of a deal to preserve a community center. Indecisive and weak-willed George grows dependent on Lucy\'s guidance on everything from legal matters to clothing. Exasperated, Lucy gives notice and picks Harvard graduate June Carter as her replacement. As Lucy\'s time at the firm nears an end, she grows jealous of June and has second thoughts about leaving George.','https://image.tmdb.org/t/p/w500/r18hSGAcxWiUysbX6nFShIZyjjP.jpg','2002-12-19',6.4,0),(21778,'A Hollywood Christmas','en','Jessica, a young, up-and-coming filmmaker in Hollywood has made a name for herself directing Christmas movies. But when handsome network executive Christopher shows up threatening to halt production on her latest movie, Jessica’s assistant, Reena, points out the irony: Jessica isn’t just trying to save her Christmas movie, she’s actually living in one. Jessica must now juggle all the classic tropes—her actors falling in and out of love, a wayward elf dog, and her own stirring romantic feelings for her perceived nemesis—in order to get her movie and her life to their happy endings.','https://image.tmdb.org/t/p/w500/f8D6dobydMiuabqRDQi0598ghc4.jpg','2022-12-01',5.8,0),(21779,'Trinity Is Still My Name','it','The two brothers Trinity and Bambino are exchanged by two federal agents and take advantage of the situation to steal a huge booty hidden in a monastery by a gang of outlaws.','https://image.tmdb.org/t/p/w500/oRd5Zb2MJEvBBxvyh3gVe6d4cAl.jpg','1971-10-21',7.4,0),(21780,'Our Father','en','After a woman\'s at-home DNA test reveals multiple half-siblings, she discovers a shocking scheme involving donor sperm and a popular fertility doctor.','https://image.tmdb.org/t/p/w500/maG75HDZbOwywDFd1h195CA8I36.jpg','2022-05-11',6.6,0),(21781,'Moontrap: Target Earth','en','A long forgotten ancient spacecraft discovered on Earth. Investigations carried out by Scout transport her to the moon whereupon she meets the impressive machines preserving the wisdom of that long lost civilization.','https://image.tmdb.org/t/p/w500/cqMH1aIvOUjeF9S0fog0zdntHtH.jpg','2017-02-07',4.6,0),(21782,'The First Time','en','Dave, a high school senior, spends most of his time pining away over a girl he can’t have. Aubrey, a junior with artistic aspirations, has a hot boyfriend who doesn’t quite understand her or seem to care. Although they go to different schools, Dave and Aubrey find themselves at the same party. When both head outside to get some air, they meet. A casual conversation sparks an instant connection, and, over the course of a weekend, things turn magical, romantic, complicated, and funny as Aubrey and Dave discover what it\'s like to fall in love for the first time.','https://image.tmdb.org/t/p/w500/tG6jUndWd9FRuvI4j5Z2bhTuq0V.jpg','2012-10-19',7,0),(21783,'Barbershop: The Next Cut','en','To survive harsh economic times, Calvin and Angie have merged the barbershop and beauty salon into one business. The days of male bonding are gone as Eddie and the crew must now contend with sassy female co-workers and spirited clientele. As the battle of the sexes rages on, a different kind of conflict has taken over Chicago. Crime and gangs are on the rise, leaving Calvin worried about the fate of his son. Together, the friends come up with a bold plan to take back their beloved neighborhood.','https://image.tmdb.org/t/p/w500/9mwzidlGgWfr2hcMWUKM86lOqdo.jpg','2016-04-15',6.3,0),(21784,'City of Ember','en','For generations, the people of the City of Ember have flourished in an amazing world of glittering lights. But Ember\'s once powerful generator is failing and the great lamps that illuminate the city are starting to flicker. Now, two teenagers, in a race against time, must search Ember for clues that will unlock the ancient mystery of the city\'s existence, before the the lights go out forever.','https://image.tmdb.org/t/p/w500/jRYNa4tBRI5vpEBT2JRtIVNoDBU.jpg','2008-10-07',6.3,0),(21785,'Reign of the Supermen','en','In the wake of The Death of Supermen, the world is still mourning the loss of the Man of Steel following his fatal battle with the monster Doomsday. However, no sooner as his body been laid to rest than do four new bearers of the Superman shield come forward to take on the mantle. The Last Son of Krypton, Superboy, Steel, and the Cyborg Superman all attempt to fill the vacuum left by the world\'s greatest champion. Meanwhile, Superman\'s death has also signaled to the universe that Earth is vulnerable. Can these new Supermen and the rest of the heroes prove them wrong?','https://image.tmdb.org/t/p/w500/e9TzqscNRUaG8HqEP3K1jUvi8pC.jpg','2019-01-13',7.1,0),(21786,'Death Note','en','A young man comes to possess a supernatural notebook, the Death Note, that grants him the power to kill any person simply by writing down their name on the pages. He then decides to use the notebook to kill criminals and change the world, but an enigmatic detective attempts to track him down and end his reign of terror.','https://image.tmdb.org/t/p/w500/1X19j2albvewAdnTNHx2fFXjOcC.jpg','2017-08-25',4.2,0),(21787,'Starship Troopers: Traitor of Mars','en','Federation trooper Johnny Rico is ordered to work with a group of new recruits on a satellite station on Mars, where giant bugs have decided to target their next attack.','https://image.tmdb.org/t/p/w500/dzqEq8Jbvb5SYGoYPqLyIRrt6Cm.jpg','2017-08-21',6,0),(21788,'Trouble','en','A pampered dog named Trouble must learn to live in the real world while trying to escape from his former owner\'s greedy children and must learn how to survive on the big-city streets.','https://image.tmdb.org/t/p/w500/yfTXk9T3iNxuOcnA72AirzueLxL.jpg','2019-08-08',6.6,0),(21789,'Moxie','en','Inspired by her mom\'s rebellious past and a confident new friend, a shy 16-year-old publishes an anonymous zine calling out sexism at her school.','https://image.tmdb.org/t/p/w500/aLBo1Ca9PggcWY98ItW5ZkdxTuA.jpg','2021-03-03',7.4,0),(21790,'Taylor Swift: The 1989 World Tour - Live','en','Filmed in front of 76,000 fans at the ANZ Stadium in Sydney, Australia, \"The 1989 World Tour Live\" captures Taylor Swift\'s entire performance while also mixing in behind-the-scene, rehearsal, and special guest footage from her 1989 Tour.','https://image.tmdb.org/t/p/w500/kzXe8kscKo83BwGvIofWg6SCR7n.jpg','2015-12-20',8.6,0),(21791,'Escape the Undertaker','en','The Undertaker has set a trap for the decorated tag team The New Day at his mansion. What they don\'t know: The Undertaker\'s mansion is an extreme Haunted House, packed to the brim with supernatural challenges. It\'s up to viewers to decide the fate of these poor souls trying to survive the wrath of The Undertaker.','https://image.tmdb.org/t/p/w500/dSF7INctoCQ4iPFRiRkZjIQIIVa.jpg','2021-10-05',5.1,0),(21792,'A Royal Winter','en','While on a last-minute European holiday, a young woman finds herself in the middle of a real-life fairy tale when a chance meeting with a handsome local leads to something more. However, things get complicated when she learns that the \"local\" is actually a prince who is about to be crowned King, and whose mother is dead-set against her royal son\'s romance with the tourist.','https://image.tmdb.org/t/p/w500/lxeJQe4lcW8AzDrRjzixOrlmihv.jpg','2017-01-14',7.2,0),(21793,'Ride Along','en','For the past two years, high-school security guard Ben has been trying to show decorated APD detective James that he\'s more than just a video-game junkie who\'s unworthy of James\' sister, Angela. When Ben finally gets accepted into the academy, he thinks he\'s earned the seasoned policeman\'s respect and asks for his blessing to marry Angela. Knowing that a ride along will demonstrate if Ben has what it takes to take care of his sister, James invites him on a shift designed to scare the hell out of the trainee. But when the wild night leads them to the most notorious criminal in the city, James will find that his new partner\'s rapid-fire mouth is just as dangerous as the bullets speeding at it.','https://image.tmdb.org/t/p/w500/ihKj5zsdkbm8FQ0IsOpAaaqPGX7.jpg','2014-01-07',6.2,0),(21794,'The Social Dilemma','en','This documentary-drama hybrid explores the dangerous human impact of social networking, with tech experts sounding the alarm on their own creations.','https://image.tmdb.org/t/p/w500/jcaM6V2tCtu6iMHDsGLBUbaYgYp.jpg','2020-01-26',7.5,0),(21795,'Margin Call','en','A thriller that revolves around the key people at an investment bank over a 24-hour period during the early stages of the financial crisis.','https://image.tmdb.org/t/p/w500/pgMIdInSIGw0uSory7yEBFGrvIS.jpg','2011-02-11',6.8,0),(21796,'Death Race 2050','en','The year 2050 the planet has become overpopulated, to help control population the government develops a race. The Death Race. Annually competitors race across the country scoring points for killing people with their vehicles.','https://image.tmdb.org/t/p/w500/5mI8yqZZBlZpvd0aT5YXbR8oEvT.jpg','2017-01-17',4.2,0),(21797,'A Christmas Miracle for Daisy','en','Whitney Alder owns interior design firm Marietta Designs, which she runs with her friend Andi in the small town of Marietta, Montana. Whitney is designing Santa’s float for the annual Marietta Christmas Parade when a potential job opportunity comes her way: the full redesign of a landmark home by Christmas Eve.','https://image.tmdb.org/t/p/w500/iatxP43TMVqSFpCFM4JybepGg0I.jpg','2021-12-11',6,0),(21798,'Palm Springs','en','When carefree Nyles and reluctant maid of honor Sarah have a chance encounter at a Palm Springs wedding, things get complicated when they find themselves unable to escape the venue, themselves, or each other.','https://image.tmdb.org/t/p/w500/yf5IuMW6GHghu39kxA0oFx7Bxmj.jpg','2020-07-10',7.3,0),(21799,'Grudge Match','en','A pair of aging boxing rivals are coaxed out of retirement to fight one final bout -- 30 years after their last match.','https://image.tmdb.org/t/p/w500/jTq9jYTKKo6EhQPso4xTMpPYYXW.jpg','2013-12-25',6.1,0),(21800,'Los verduleros','es','The adventures of two friends, one a chicken vendor in a market and the other a policeman. They have love affairs and capture criminals.','https://image.tmdb.org/t/p/w500/y8u1Y9ydobRfsLFCP4Hoxo4g0Fw.jpg','1986-02-07',7.3,0),(21801,'13: The Musical','en','After moving from New York City to Indiana, a 12 year old navigates his parents\' divorce, his impending bar mitzvah and his new school\'s social circles.','https://image.tmdb.org/t/p/w500/rqShG2kTbsVbgrgjfoEwawjR88N.jpg','2022-08-12',6.1,0),(21802,'Village of the Damned','en','An American village is visited by some unknown life form which leaves the women of the village pregnant. Nine months later, the babies are born, and they all look normal, but it doesn\'t take the \"parents\" long to realize that the kids are not human or humane.','https://image.tmdb.org/t/p/w500/1Iezq745huWW3xB5xQMPDdyyWx7.jpg','1995-04-28',6.1,0),(21803,'Scooby-Doo! and WWE: Curse of the Speed Demon','en','When Scooby and Mystery Inc. visit an off-road racing competition, it\'s not long before strange events start to occur. A mysterious phantom racer, known only as Inferno, is causing chaos and is determined to sabotage the race. It\'s up to Scooby-Doo, Shaggy and their new driving partner, The Undertaker, to save the race and solve the mystery.','https://image.tmdb.org/t/p/w500/kCWtWbZhyY48XpYC3n5hinuufH.jpg','2016-08-09',7.7,0),(21804,'Please Enlighten Me','zh','A  story between Lin Zhi Xiao, a graduating student from the Conservatory of Music, and her father\'s attending physician Gu Wei. Fourth-year student Lin Zhi Xiao hits rock bottom right before her graduation. Her father is hospitalized due to cancer leaving her no choice but to give up the chance to work at a reputable company. She also bears the pain from a relationship that has ended. All her beautiful imaginations towards love and her future are shattered in an instant. Just then, her father\'s doctor Gu Wei walks into Lin Zhi Xiao\'s life. When love begins, people often don\'t know that it\'s love. Two people who have been hurt before and no longer believe in love start to get to know each other. There are uncertainties and setbacks, misunderstandings and downturns, but in the process of falling in love, they become more assured that they have found the person to whom they can entrust the rest of their lives.','https://image.tmdb.org/t/p/w500/sGbDFapR6XNPk6k4RHi2Bj3oNO6.jpg','2021-02-03',6.6,0),(21805,'Ghosts of War','en','A group of World War II American soldiers encounter a supernatural enemy as they occupy a French castle previously under Nazi control.','https://image.tmdb.org/t/p/w500/jBeL6pPUPo0wnyTmiuxPegcibPf.jpg','2020-07-03',6.3,0),(21806,'Alien Outpost','en','A documentary crew follows an elite unit of soldiers in the wake of an alien invasion.','https://image.tmdb.org/t/p/w500/dXe0HXP66DyTv6mw5pxbGq89knr.jpg','2014-09-19',5.3,0),(21807,'Red Corner','en','An American attorney on business in China, ends up wrongfully on trial for murder and his only key to innocence is a female defense lawyer from the country.','https://image.tmdb.org/t/p/w500/xsIbKOO1CacqTagyJmEGGf4kOnn.jpg','1997-10-30',6.2,0),(21808,'In the Heights','en','The story of Usnavi, a bodega owner who has mixed feelings about closing his store and retiring to the Dominican Republic or staying in Washington Heights.','https://image.tmdb.org/t/p/w500/RO4KoJyoQMQzh9z76d4v4FJMmJ.jpg','2021-06-10',7.3,0),(21809,'Twin Peaks: Fire Walk with Me','en','In the questionable town of Deer Meadow, Washington, FBI Agent Desmond inexplicably disappears while hunting for the man who murdered a teen girl. The killer is never apprehended, and, after experiencing dark visions and supernatural encounters, Agent Dale Cooper chillingly predicts that the culprit will claim another life. Meanwhile, in the more cozy town of Twin Peaks, hedonistic beauty Laura Palmer hangs with lowlifes and seems destined for a grisly fate.','https://image.tmdb.org/t/p/w500/rol5H6loAojd6tH2VXQYEXzGQk1.jpg','1992-06-03',7.3,0),(21810,'Zookeeper','en','Kindhearted Griffin Keyes is one of the best-loved caretakers at the Franklin Park Zoo, but since he is more comfortable with the animals than with females of his own species, his love life is lacking. When Griffin decides that the only way to get a girlfriend is to find a more-glamorous career, the animals panic. To keep him from leaving, they reveal their secret ability to talk and offer to teach him the rules of courtship, animal-style.','https://image.tmdb.org/t/p/w500/y3b4AYw8dr4hIKTfEAjxUxx0z8G.jpg','2011-07-06',5.4,0),(21811,'Dark Skies','en','From the producers of Paranormal Activity, Insidious, and Sinister comes Dark Skies: a supernatural thriller that follows a young family living in the suburbs. As husband and wife Daniel and Lacey Barret witness an escalating series of disturbing events involving their family, their safe and peaceful home quickly unravels. When it becomes clear that the Barret family is being targeted by an unimaginably terrifying and deadly force, Daniel and Lacey take matters in their own hands to solve the mystery of what is after their family.','https://image.tmdb.org/t/p/w500/euLgEo2kvuLjYxbfOekWF3l82t6.jpg','2013-02-21',6.3,0),(21812,'U Turn','en','When Bobby\'s car breaks down in the desert while on the run from some of the bookies who have already taken two of his fingers, he becomes trapped in the nearby small town where the people are stranger than anyone he\'s encountered. After becoming involved with a young married woman, her husband hires Bobby to kill her. Later, she hires Bobby to kill the husband.','https://image.tmdb.org/t/p/w500/lffvjJU8j7RLfz1SJVMfrn2wH6i.jpg','1997-10-03',6.6,0),(21813,'I Now Pronounce You Chuck & Larry','en','Firefighters Chuck Ford and Larry Valentine are guy\'s guys, loyal to the core—which is why when widower Larry asks Chuck to pose as his lover so that he can get domestic partner benefits for his kids, his buddy agrees. However, things get dicey when a bureaucrat comes calling, and the boys are forced to present a picture of domestic bliss.','https://image.tmdb.org/t/p/w500/6wjJ9EnNw4cmTSZYgnao7RpI3X.jpg','2007-07-12',6,0),(21814,'Asterix & Obelix: God Save Britannia','fr','Asterix crosses the channel to help second-cousin Anticlimax face down Julius Caesar and invading Romans.','https://image.tmdb.org/t/p/w500/rbdGCkvLPxuSvfVwHDK4PmOqmIm.jpg','2012-10-17',5.1,0),(21815,'Eliminators','en','A former US Federal Agent must abandon the witness protection program and come out of hiding when his London home is invaded in error due to a wrong address. When the event ends with multiple homicides, the news triggers those hunting him to send Europe\'s most dangerous assassin to kill him. Now on the run with his daughters life in jeopardy, a determined father must get her to safety before the people he\'s been hiding from tracks him down.','https://image.tmdb.org/t/p/w500/pUB91wOMQrmkforP7ntIMy2zkdn.jpg','2016-12-06',6.4,0),(21816,'Me gusta, pero me asusta','es','Brayan Rodriguez is an innocent heir to a criminal Sinaloa family sent to Mexico City to expand the business, and where he meets Claudia, and their worlds collide. Love and fun are everywhere.','https://image.tmdb.org/t/p/w500/k8YhZyktGdm13z4sOgOTy8ZfwCZ.jpg','2017-09-22',7.9,0),(21817,'The Best of Me','en','A pair of former high school sweethearts reunite after many years when they return to visit their small hometown.','https://image.tmdb.org/t/p/w500/8QBWh2Iwf1iUfsu2NfCue2V1hpV.jpg','2014-10-15',7.5,0),(21818,'Next Friday','en','A streetwise man flees South Central Los Angeles, heading to the suburbs and his lottery-winner uncle and cousin, to avoid a neighborhood thug with a grudge who has just escaped from prison.','https://image.tmdb.org/t/p/w500/dP4fYCGQZzg17ta7FvLwJVCwwt9.jpg','2000-01-12',6.4,0),(21819,'Tom and Jerry: The Movie','en','The popular cartoon cat and mouse are thrown into a feature film. The story has the twosome trying to help an orphan girl who is being berated and exploited by a greedy guardian.','https://image.tmdb.org/t/p/w500/k68ZB5trRKcEJSQdPiY6jtxVq14.jpg','1992-10-01',6.3,0),(21820,'St. Vincent','en','A young boy whose parents just divorced finds an unlikely friend and mentor in the misanthropic, bawdy, hedonistic, war veteran who lives next door.','https://image.tmdb.org/t/p/w500/1bb7MTHCIPhpKZFysDpxNaNrdMk.jpg','2014-10-09',7.1,0),(21821,'Crocodile Dundee II','en','Australian outback expert protects his New York love from gangsters who\'ve followed her down under.','https://image.tmdb.org/t/p/w500/2Nf0xeDuToLHysdkWj3aT5r42rC.jpg','1988-05-19',5.8,0),(21822,'Street Fighter','en','Col. Guile and various other martial arts heroes fight against the tyranny of Dictator M. Bison and his cohorts.','https://image.tmdb.org/t/p/w500/6yh95dD2Y6uWAlPfWCZZygBM1ec.jpg','1994-12-23',4.6,0),(21823,'Crocodile Dundee','en','When a New York reporter plucks crocodile hunter Dundee from the Australian Outback for a visit to the Big Apple, it\'s a clash of cultures and a recipe for good-natured comedy as naïve Dundee negotiates the concrete jungle. Dundee proves that his instincts are quite useful in the city and adeptly handles everything from wily muggers to high-society snoots without breaking a sweat.','https://image.tmdb.org/t/p/w500/pduPduL1ub5kok3lPYT15ryC9L6.jpg','1986-09-26',6.4,0),(21824,'Curiosa','fr','A passionate love story set against a backdrop of sexual freedom, loosely based on the relationship between 19th century authors Pierre Louÿs and Marie de Régnier','https://image.tmdb.org/t/p/w500/w2EkSSlJvW8xefsRkW2yaUCOiMt.jpg','2019-04-03',6.1,0),(21825,'Vice','en','Julian Michaels has designed the ultimate resort: VICE, where anything goes and the customers can play out their wildest fantasies with artificial inhabitants who look, think and feel like humans. When an artificial becomes self-aware and escapes, she finds herself caught in the crossfire between Julian\'s mercenaries and a cop who is hell-bent on shutting down Vice, and stopping the violence once and for all.','https://image.tmdb.org/t/p/w500/cBwZIq1QFasmsC9Wi3HvyEljfYN.jpg','2015-01-16',4.4,0),(21826,'The Stolen Princess','uk','This wonderful story happened in the age of valiant knights, beautiful princesses, and battling sorcerers. Ruslan, a wandering artist dreaming to become a knight, met beautiful Mila and fell in love with her; he didn’t even suspect that she is the King’s daughter. However, the lovers’ happiness wasn’t meant to last too long. Chernomor, the evil sorcerer, appeared in a magic vortex and stole Mila right before Ruslan’s eyes to transform her power of love into his own magic power. Without further ado, Ruslan sets out on a chase after the stolen princess to overcome all obstacles and to prove that real love is stronger than magic.','https://image.tmdb.org/t/p/w500/4v6MoBcbCSI5Kw6AQVYLTJ