ly challenged girl who believes Enzo’s the hero from her favorite Japanese anime series, Steel Jeeg.','https://image.tmdb.org/t/p/w500/zvJPbyWflWHbHMHSdue1n4N69tC.jpg','2016-02-25',7.4,0),(21834,'On the Basis of Sex','en','Young lawyer Ruth Bader Ginsburg teams with her husband Marty to bring a groundbreaking case before the U.S. Court of Appeals and overturn a century of sex discrimination.','https://image.tmdb.org/t/p/w500/izY9Le3QWtu7xkHq7bjJnuE5yGI.jpg','2018-12-25',7.4,0),(21835,'Bayala: A Magical Adventure','de','As the dragons have almost disappeared from the kingdom of Bayala, the magic powers of the fairies are weakening. The fairy princesses Sera and Surah are thrilled when they discover they have the key to save the world in their hands: a dragon egg! Now the sisters must reach the dragon mountains and they embark on an adventurous journey into the unknown...','https://image.tmdb.org/t/p/w500/ouKUXkQSLyC4ADXbC8ft7vxiIJF.jpg','2019-10-24',5.8,0),(21836,'Beautiful Minds','fr','Two men, why vastly different life stories and personalities, embark on a Hearse heading south of France. During their journey, they realize that however unlikely, they\'re not so different in the end.','https://image.tmdb.org/t/p/w500/6GhxXwWZFo47xVfzYym4zvjxtDo.jpg','2022-01-19',7.4,0),(21837,'Batman: Gotham by Gaslight','en','In an alternative Victorian Age Gotham City, Batman begins his war on crime while he investigates a new series of murders by Jack the Ripper.','https://image.tmdb.org/t/p/w500/7souLi5zqQCnpZVghaXv0Wowi0y.jpg','2018-01-12',6.7,0),(21838,'Lassie Come Home','de','12-year-old Florian and his beloved dog Lassie live in an idyllic village in the German countryside. When Florian\'s father loses his job, the family have to move into a small apartment where there are no dogs allowed. Lassie is given away to another family, but Florian and Lassie yearn to be reunited again so Florian sets out on an adventure to find his best friend.','https://image.tmdb.org/t/p/w500/ffh