db.org/t/p/w500/8iXpVITXenqPG8gQ0lCFpUMtZIx.jpg','2003-02-28',6.1,0),(21844,'The Gift','en','Simon and Robyn are a young married couple whose life is going as planned until a chance run-in with Simon\'s high school acquaintance sends their world into a tailspin.','https://image.tmdb.org/t/p/w500/kH3qLP8pn68Xq5XwvmPkCyaAU7W.jpg','2015-07-31',6.7,0),(21845,'An American Werewolf in Paris','en','An American man unwittingly gets involved with werewolves who have developed a serum allowing them to transform at will.','https://image.tmdb.org/t/p/w500/1NUOprbP7LLfKPArLJY7wziUiHT.jpg','1997-05-29',6,0),(21846,'Primeval','en','A news team is sent to Burundi to capture and bring home a legendary 25-foot crocodile. Their difficult task turns potentially deadly when a warlord targets them for death.','https://image.tmdb.org/t/p/w500/5ou56J8FIxbIFusR9zIA9GW7zwt.jpg','2007-01-12',6.1,0),(21847,'Anchorman: The Legend of Ron Burgundy','en','It\'s the 1970s and San Diego anchorman Ron Burgundy is the top dog in local TV, but that\'s all about to change when ambitious reporter Veronica Corningstone arrives as a new employee at his station.','https://image.tmdb.org/t/p/w500/Rdzsh3s6waplhSD7PUaBJovB7v.jpg','2004-06-28',6.7,0),(21848,'Wolfwalkers','en','In a time of superstition and magic, when wolves are seen as demonic and nature an evil to be tamed, a young apprentice hunter comes to Ireland with her father to wipe out the last pack. But when she saves a wild native girl, their friendship leads her to discover the world of the Wolfwalkers and transform her into the very thing her father is tasked to destroy.','https://image.tmdb.org/t/p/w500/ehAKuE48okTuonq6TpsNQj8vFTC.jpg','2020-10-26',8.3,0),(21849,'Traffic','en','An exploration of the United States of America\'s war on drugs from multiple perspectives. For the new head of the Office of National Drug Control Policy, the war becomes personal when he discovers his well-educated daughter is abusing cocaine within their comfortable subu