dsky who wants power and is a threat to their pals: Fred, Velma, and Daphne.','https://image.tmdb.org/t/p/w500/tWBCvtJRlZo83Pn5kF8HNrOiZnE.jpg','2008-09-23',7.9,0),(21856,'The Spy Next Door','en','Former CIA spy Bob Ho takes on his toughest assignment to date: looking after his girlfriend\'s three kids, who haven\'t exactly warmed to their mom\'s beau. And when one of the youngsters accidentally downloads a top-secret formula, Bob\'s longtime nemesis, a Russian terrorist, pays a visit to the family.','https://image.tmdb.org/t/p/w500/nJJrceb2xHGIA0irADX0JvWSIHT.jpg','2010-01-15',5.9,0),(21857,'Borat: Cultural Learnings of America for Make Benefit Glorious Nation of Kazakhstan','en','Kazakh journalist Borat Sagdiyev travels to America to make a documentary. As he zigzags across the nation, Borat meets real people in real situations with hysterical consequences. His backwards behavior generates strong reactions around him exposing prejudices and hypocrisies in American culture.','https://image.tmdb.org/t/p/w500/kfkyALfD4G1mlBJI1lOt2QCra4i.jpg','2006-11-01',6.7,0),(21858,'Brahmāstra Part One: Shiva','hi','The story of Shiva – a young man on the brink of an epic love, with a girl named Isha. But their world is turned upside down when Shiva learns that he has a mysterious connection to the Brahmāstra... and a great power within him that he doesn’t understand just yet - the power of Fire.','https://image.tmdb.org/t/p/w500/x61qdvHIsr9U53FwoLVDQqAGur0.jpg','2022-09-08',6.7,0),(21859,'Buzz Lightyear of Star Command: The Adventure Begins','en','Buzz Lightyear must battle Emperor Zurg with the help of three hopefuls who insist on being his partners.','https://image.tmdb.org/t/p/w500/3IXeVITL3FJ9CKpBK7lzULuw8Ts.jpg','2000-08-08',6.4,0),(21860,'In Full Bloom','en','Set shortly after the end of World War II, a philosophical boxing drama of two fighters from opposite worlds (USA and Japan) who are pulled together for a questionable fight arranged by their unscrupulous managers and 