en','Lina is about to graduate high school and has her sights set on her future at MIT. But when her mom gets sick, she encourages Lina to follow in her footsteps and have “the summer of a lifetime” in Rome. Using her mom’s old diary as a guide, she explores the romantic and magical city, where she just might find love... and gelato, of course.','https://image.tmdb.org/t/p/w500/AbGBTH3bWaiJpjCOJ9RSoQ9NPRT.jpg','2022-06-22',5.4,0),(21866,'While You Were Sleeping','en','A transit worker pulls commuter Peter off railway tracks after he\'s mugged, but—while he\'s in a coma—his family mistakenly thinks she\'s Peter\'s fiancée, and she doesn\'t correct them. Things get more complicated when she falls for his brother, who\'s not quite sure that she\'s who she claims to be.','https://image.tmdb.org/t/p/w500/xrXUADqC2gt84BPYzNtXxAJEfbo.jpg','1995-04-21',6.9,0),(21867,'Dragonheart: Battle for the Heartfire','en','When the King Gareth dies, his potential heirs, twin grandchildren who possess the dragon’s unique strengths, use their inherited powers against each other to vie for the throne. When Drago’s source of power – known as the Heartfire – is stolen, more than the throne is at stake; the siblings must end their rivalry with swords and sorcery or the kingdom may fall.','https://image.tmdb.org/t/p/w500/nPjqwumVHyx2nOCyZH5dpXAmhpf.jpg','2017-07-09',6.2,0),(21868,'Commitment to Life','en','Against a rich Hollywood backdrop, \"Commitment to Life\" documents the true story of the fight against HIV/AIDS in Los Angeles - and how an intrepid group of people living with HIV/AIDS, doctors, movie stars, studio moguls and activists changed the course of the epidemic.','https://image.tmdb.org/t/p/w500/2GBQLto8W33Tc1CMEpL8Zk1KEYD.jpg','2023-02-10',0,0),(21869,'District 13: Ultimatum','fr','Damien and Leito return to District 13 on a mission to bring peace to the troubled sector that is controlled by five different gang bosses, before the city’s secret services take drastic measures to solve the problem.','https://image.tmdb.org/t/p/w500/8okAUSzfWiudSYMXLJYBnlcILcz.jpg','2009-02-18',6.4,0),(21870,'The Walk','en','The story of French high-wire artist Philippe Petit\'s attempt to cross the Twin Towers of the World Trade Center in 1974.','https://image.tmdb.org/t/p/w500/tiESRqurrZwAC0hpERogOsBhjeg.jpg','2015-09-30',7,0),(21871,'White Palace','en','Max Baron is a Jewish advertising executive in his 20s who\'s still getting over the death of his wife. Nora Baker is a 40-something diner waitress who enjoys the wilder side of life. Mismatched or not, their attraction is instant and smoldering. With time, however, their class and age differences become an obstacle in their relationship, especially since Max can\'t keep Nora a secret from his Jewish friends and upper-crust associates forever.','https://image.tmdb.org/t/p/w500/2PjOaLA3iYEfQT6fw1EvIczu63u.jpg','1990-10-19',6.2,0),(21872,'The Haunted Mansion','en','Workaholic Jim Evers and his wife/business partner Sara get a call one night from  a mansion owner, Edward Gracey, who wants to sell his house. Once the Evers family arrive at the mansion, a torrential thunderstorm of mysterious origin strands them with the brooding, eccentric Gracey, his mysterious butler, and a variety of residents both seen and unseen.','https://image.tmdb.org/t/p/w500/lGi5yio4pdDz5PkSeZCbnMQz5vK.jpg','2003-11-25',5.6,0),(21873,'From Beyond','en','A group of scientists have developed the Resonator, a machine which allows whoever is within range to see beyond normal perceptible reality. But when the experiment succeeds, they are immediately attacked by terrible life forms.','https://image.tmdb.org/t/p/w500/yvBRkNA8wiuXupFk0Z7b5NhYW9r.jpg','1986-10-24',6.6,0),(21874,'The Wave','de','A school teacher discusses types of government with his class. His students find it too boring to repeatedly go over national socialism and believe that dictatorship cannot be established in modern Germany. He starts an experiment to show how easily the masses can become manipulated.','https://image.tmdb.org/t/p/w500/vtJ4u0fpTZhibxAJHzXtcdCxhsL.jpg','2008-03-11',7.5,0),(21875,'RoboCop 3','en','The mega corporation Omni Consumer Products is still bent on creating their pet project, Delta City, to replace the rotting city of Detroit. Unfortunately, the inhabitants of the area have no intention of abandoning their homes simply for desires of the company. To this end, OCP have decided to force them to leave by employing a ruthless mercenary army to attack and harass them. An underground resistance begins and in this fight, Robocop must decide where his loyalties lie.','https://image.tmdb.org/t/p/w500/ppLSSwCuC5ERRWbu9H3R8SPL9AM.jpg','1993-11-05',4.7,0),(21876,'Under the Sea: A Descendants Story','en','Mal emerges from the shadows of a mystical forest onto a dark coastline where she crosses paths with Dizzy.','https://image.tmdb.org/t/p/w500/kKrTUnslvqpAmTX4jRkfIbGVfEA.jpg','2018-09-28',7.7,0),(21877,'Get Smart','en','When the identities of secret agents from Control are compromised, the Chief promotes hapless but eager analyst Maxwell Smart and teams him with stylish, capable Agent 99, the only spy whose cover remains intact. Can they work together to thwart the evil plans of KAOS and its crafty operative?','https://image.tmdb.org/t/p/w500/c1x9EYmTTe9xTM8DclELORwC1PN.jpg','2008-06-19',6.2,0),(21878,'High Strung Free Dance','en','Zander Raines, a dazzling and tempestuous young choreographer, gives the break of a lifetime to two hopeful artists when he casts a stunning contemporary dancer, Barlow, and innovative pianist, Charlie, in New York’s most-anticipated new Broadway show: Free Dance. But the move throws off the show’s delicate creative balance when Charlie falls hard for Barlow, while Zander embraces her as his muse.','https://image.tmdb.org/t/p/w500/dOdWTC9gvdQLhN1eYpiy77c2QEQ.jpg','2018-09-13',7.3,0),(21879,'Hotel Mumbai','en','Mumbai, India, November 26, 2008. While several terrorists spread hatred and death t