ey prepare for the Snoggletog Festival, it quickly becomes clear that the new generation of Vikings don’t remember the bond between dragon and human.','https://image.tmdb.org/t/p/w500/wrYEFwaLo5JgHkLdveWtGH6Jygw.jpg','2019-12-05',6.8,0),(21884,'Killer Bean Forever','en','When things go bad in Beantown, top assassin Killer Bean is called to clean-up the mess. Detective Cromwell finds himself in the middle between Killer Bean and mob boss Cappuccino.','https://image.tmdb.org/t/p/w500/6qzFNzWtgc7nH4j4I6odnoJP66H.jpg','2008-09-05',7.3,0),(21885,'No Man of God','en','The complicated relationship that formed between the FBI analyst Bill Hagmaier and serial killer Ted Bundy during Bundy\'s final years on death row.','https://image.tmdb.org/t/p/w500/jJzmSlNorOu6yvHSjXoF0bBcx17.jpg','2021-08-19',6.8,0),(21886,'Erotic Nightmare','cn','Anthony Wong is a rich sex-deprived man who meets a Monk, who offers him an erotic dream. He becomes addicted to the dream and falls in love with the beautiful female student in it. Unfortunately, the dream is part of the Monk\'s conspiracy to obtain or destroy all that matters to him. Once Wong finally finishes his dream, things start going horribly wrong','https://image.tmdb.org/t/p/w500/oAhoJB26AFudZjHigoAV6tBaPtM.jpg','1999-05-20',5.2,0),(21887,'See No Evil','en','A group of delinquents are sent to clean the Blackwell Hotel but little do they know reclusive psychopath Jacob Goodnight has holed away in the rotting hotel. When one of the teens is captured, those who remain band together to survive against the brutal killer.','https://image.tmdb.org/t/p/w500/uA6hwY75mhewYK2tAib1LJclhbD.jpg','2006-05-19',5.4,0),(21888,'I\'m Thinking of Ending Things','en','Nothing is as it seems when a woman experiencing misgivings about her new boyfriend joins him on a road trip to meet his parents at their remote farm.','https://image.tmdb.org/t/p/w500/5ynWWapdl45hJXUh0KIevxSG9JQ.jpg','2020-08-28',6.6,0),(21889,'Careful What You Wish For','en','A guy gets more than he bargained for after entering into an affair with the wife of an investment banker. Soon, a suspicious death and substantial life insurance policy embroil him in a scandal.','https://image.tmdb.org/t/p/w500/7TCNLuxwzsU9IXYvzzYQdwJe19v.jpg','2015-05-06',6.1,0),(21890,'Lego DC Batman: Family Matters','en','Suspicion is on high after Batman, Batgirl, Robin and other DC superheroes receive mysterious invitations. However, family values must remain strong when Batman and his team encounter the villainous Red Hood, who is obsessed with destroying the Bat-family and all of Gotham City.','https://image.tmdb.org/t/p/w500/wPdlrMbdxt4lct9gO43KxUvfENw.jpg','2019-07-21',7.1,0),(21891,'Haywire','en','A black ops soldier seeks payback after she is betrayed and left for dead.','https://image.tmdb.org/t/p/w500/iI3KOQOyTMJgxccs50zjxn3R7DF.jpg','2011-11-01',5.7,0),(21892,'Burlesque','en','Ali, a small-town gal with a great voice, leaves a troubled life behind and follows her dreams to Los Angeles. She lands a job as a cocktail waitress at the Burlesque Lounge, a once-majestic theater that houses an inspired musical revue led by Tess, the proprietor. Ali vows to perform there and, with the help of a savvy stage manager and a gender-bending host, she makes the leap from bar to stage, helping restore the club\'s former glory.','https://image.tmdb.org/t/p/w500/3U9zBIibERQZqYKM3N1a4MYgBsN.jpg','2010-11-23',7.2,0),(21893,'ARQ','en','Two old friends living in a dystopic future become trapped in a mysterious time loop — one that may have something to do with an ongoing battle between an omnipotent corporation and a ragtag band of rebels.','https://image.tmdb.org/t/p/w500/mU4VeXVK18JtCZsy7i0zczlA9p7.jpg','2016-09-16',6.1,0),(21894,'Wyatt Earp','en','Covering the life and times of one of the West\'s most iconic heroes.','https://image.tmdb.org/t/p/w500/51LItgyecu2KMAtIchYogEykCIu.jpg','1994-06-24',6.8,0),(21895,'Sofia the First: Once Upon a Princess','en','Set in the storybook world of 