d to a rave whose host plans to show them all the truth behind the Cenobite mythos.','https://image.tmdb.org/t/p/w500/nc2KcfOWhugGP4HeiqUyt0Swyl3.jpg','2005-09-06',4.8,0),(21901,'Coneheads','en','A pair of aliens arrive on Earth to prepare for invasion, but crash instead. With enormous cone-shaped heads, robotlike walks and an appetite for toilet paper, aliens Beldar and Prymatt don\'t exactly blend in with the population of Paramus, N.J. But for some reason, everyone believes them when they say they\'re from France.','https://image.tmdb.org/t/p/w500/2HLX4Kc15FOA1HHjOl0AuKex6ym.jpg','1993-07-23',5.3,0),(21902,'Bully','en','A pack of naïve teenagers conspire to murder a mutual friend, whose aggressive demeanor has proved too much.','https://image.tmdb.org/t/p/w500/vMJ2WHBbK4Jr3eDuF1e7O6lbC8m.jpg','2001-06-15',6.6,0),(21903,'Jumanji','en','When siblings Judy and Peter discover an enchanted board game that opens the door to a magical world, they unwittingly invite Alan -- an adult who\'s been trapped inside the game for 26 years -- into their living room. Alan\'s only hope for freedom is to finish the game, which proves risky as all three find themselves running from giant rhinoceroses, evil monkeys and other terrifying creatures.','https://image.tmdb.org/t/p/w500/vgpXmVaVyUL7GGiDeiK1mKEKzcX.jpg','1995-12-15',7.2,0),(21904,'The Seventh Sign','en','Abby is a pregnant woman with a curious new boarder in the apartment over her garage. Turns out he\'s heaven-sent and is speeding along the Apocalypse by bloodying rivers, egging on plagues and following scripture word for word.','https://image.tmdb.org/t/p/w500/vAgVzkPmfe2pcgzkpoz8cZ9i9wm.jpg','1988-04-01',6.1,0),(21905,'What About Love','en','Two young lovers change the lives of their parents forever when the parents learn from the joyful experience of their kids, and allow themselves to again find their love.','https://image.tmdb.org/t/p/w500/jGVpMWEemYCSa2p9OSCMsaBXY98.jpg','2023-02-14',0,0),(21906,'The Rover','en','10 years after a global economic collapse, a hardened loner pursues the men who stole his car through the lawless wasteland of the Australian outback, aided by the brother of one of the thieves.','https://image.tmdb.org/t/p/w500/734OOkr69mt8lyPk8iw3TwgQ90R.jpg','2014-06-04',6.3,0),(21907,'¡Asu Mare!','es','Follows the adventures of Carlos Alcántara on his way to fame from his childhood in the \"Unidad Vecinal Mirones\".','https://image.tmdb.org/t/p/w500/lvMeJr4IaQl4mxcWTRmW6J6ITOh.jpg','2013-04-11',7.3,0),(21908,'Murder Mystery 2','en','Now private detectives launching their own agency, Nick and Audrey Spitz land at the center of an international investigation when a friend is abducted.','https://image.tmdb.org/t/p/w500/wdffZv8gIiWy6xr4t7hWBWtUwpl.jpg','2023-03-31',0,0),(21909,'The Guardian Brothers','zh','There\'s a crisis in the Chinese Spirit World -- humans don\'t believe in gods anymore! A Door God, facing unemployment, ventures into the human world to prove his worth, leading to unexpected encounters and transformations for humans and spirits alike.','https://image.tmdb.org/t/p/w500/A2Sl9BRnVG8LqYQqjvtRG1zZ2TP.jpg','2015-06-25',5.8,0),(21910,'Monster High: Frights, Camera, Action!','en','When Draculaura is led to believe she\'s the rightful heir to the vampire throne, she and her best ghoulfriends are whisked away to Transylvania for a royal coronation to die for. But they soon discover the hunt for the queen is not over yet. The Ghouls must locate an ancient artifact known as the Vampire\'s Heart in order to discover the identity of the true Vampire Queen. It\'s a fangtastic adventure that will lead them from the Tower of Londoom, to a haunted river boat in New Goreleans and finally to the glamorous boo-vie lots of Hauntlywood. Could this be the moment when Draculara finally receives her vampire powers and discovers screams really can come true?','https://image.tmdb.org/t/p/w500/kGlTFeilg6RtyYi86kRQRml8CRG.jpg','2014-03-25',7.3,0),(21911,'The Lives of Others','de'