s to Hansel and Gretel, the Super Monsters reimagine classic fairy tales and favorite nursery rhymes with a musical, magical spin!','https://image.tmdb.org/t/p/w500/unIkHTdCEIdHdtmWjEwfv7Ifllk.jpg','2021-06-01',6.2,0),(21917,'Euphoria','en','The story of two sisters on a journey, where they try to get close to each other and approach the tough questions in life. Euphoria is a contemporary drama about responsibility and reconciliation, in a world where these concepts are gradually being lost.','https://image.tmdb.org/t/p/w500/Anw3eLdNVRXafpYktwRzAGd6sPW.jpg','2018-02-01',6.4,0),(21918,'Pooh\'s Grand Adventure: The Search for Christopher Robin','en','Pooh gets confused when Christopher Robin leaves him a note to say that he has gone back to school after the holidays. So Pooh, Piglet, Tigger, Eeyore and Rabbit go in search of Christopher Robin which leads to a big adventure.','https://image.tmdb.org/t/p/w500/tjk2Ig3I5bQvPUEH3A83aZebXEy.jpg','1997-08-05',7.2,0),(21919,'Reign Over Me','en','A man who lost his family in the September 11 attack on New York City runs into his old college roommate. Rekindling the friendship is the one thing that appears able to help the man recover from his grief.','https://image.tmdb.org/t/p/w500/b5EtDvwj2gdG1qMBLijamlLfJLB.jpg','2007-03-22',7.2,0),(21920,'World Trade Center','en','Two police officers struggle to survive when they become trapped beneath the rubble of the World Trade Center on September 11, 2001.','https://image.tmdb.org/t/p/w500/bfTiVc8kxq8uRXeblV3Ct35APGu.jpg','2006-08-09',6.1,0),(21921,'Carol','en','In 1950s New York, a department-store clerk who dreams of a better life falls for an older, married woman.','https://image.tmdb.org/t/p/w500/A8JV3ockAvWOXmcNZyAGqlyTTBw.jpg','2015-11-20',7.5,0),(21922,'Scooby-Doo! Legend of the Phantosaur','en','A relaxing spa getaway evolves into a prehistoric panic when Scooby-Doo and the gang uncover the horrible Phantosaur, an ancient legend come to life to protect hidden treasures buried 