e to three fragile whalers. Alone in the middle of the Pacific Ocean, the men must decide whether to head for the nearest islands - a thousand miles downwind to the west - or set out on an epic journey of almost three thousand miles to reach the South American mainland. Fear of cannibals forces them to choose South America.  Almost three months later, the first whaler is rescued by another whaleship. Only three men are still alive. A week later the captain\'s whaler is also rescued, with just two men aboard. The third whaler is never found.  This is a story of human endurance and what men in extremis will do to survive.','https://image.tmdb.org/t/p/w500/tgLAX0TCI7JHuE5Q4ihXpW1eDPP.jpg','2013-12-22',5.3,0),(21928,'JLA Adventures: Trapped in Time','en','Get ready for a battle of the ages when the Justice League faces off against its archenemies, the Legion of Doom, in an all-new movie from DC Comics. A mysterious being known as the Time Trapper arises, and a sinister plan led by Lex Luthor sends the Legion of Doom back in time to eliminate Superman, Wonder Woman and Batman before they become super heroes. For Aquaman, Flash and Cyborg, along with teen super heroes Karate Kid and Dawnstar, the stakes have never been higher, the rescue mission never deadlier. So join the fight for the future as the Justice League confronts its ultimate challenge… the threat of having never existed!','https://image.tmdb.org/t/p/w500/bm8LNDoKWWPnDTEAxJ6VrlPHWub.jpg','2014-01-21',6.7,0),(21929,'The House That Jack Built','en','Failed architect, engineer and vicious murderer Jack narrates the details of some of his most elaborately orchestrated crimes, each of them a towering piece of art that defines his life\'s work as a serial killer for twelve years.','https://image.tmdb.org/t/p/w500/bMUGNkPaHOurcBK9g3XpJx3fxuO.jpg','2018-10-04',7.2,0),(21930,'Island of Desire','tl','A nurse is assigned to work at an island called Isla Bato, where men treat women with lust. As she experiences the people\'s madness, she plans a way to get out of the island.','https://image.tmdb.org/t/p/w500/slUdgOokJLkVwSJ9YQOwUv1IVgt.jpg','2022-04-01',4.1,0),(21931,'The Imaginarium of Doctor Parnassus','en','A travelling theatre company has more to it than meets the eye. It is an imaginary world commanded by the mind of Doctor Parnassus and the audience is in for more than just a show.','https://image.tmdb.org/t/p/w500/frkXs6OkFWxbn4RyykVUnYiD64W.jpg','2009-10-01',6.4,0),(21932,'The Mystery of Lop Nur','zh','The film mainly tells about the bizarre cases in the Lop Nur area during the Republic of China. Shi Chuqi, the president of the mysterious incident investigation organization \"Seven Sons\", led the team members to solve the mystery. The film focuses on many mysterious and unresolved events based on elements such as exploring the unknown and revealing the truth. It also adds science fiction elements of ancient space civilization to satisfy the audience\'s curiosity.','https://image.tmdb.org/t/p/w500/aiPmEv3XxITXvVtNklCf7YdtqLZ.jpg','2022-02-23',2,0),(21933,'Can\'t Buy Me Love','en','Nerdy high schooler Ronald Miller rescues cheerleader Cindy Mancini from parental punishment after she accidentally destroys her mother\'s designer clothes. Ronald agrees to pay for the $1,000 outfit on one condition: that she will act as though they\'re a couple for an entire month. As the days pass, however, Cindy grows fond of Ronald, making him popular. But when Ronald\'s former best friend gets left behind, he realizes that social success isn\'t everything.','https://image.tmdb.org/t/p/w500/uHCkUHe63HUkWPmUmJ0kPmOQchJ.jpg','1987-08-14',7,0),(21934,'Slumber','en','A sleep doctor tries to protect a family from a demon that feeds on people in their nightmares.','https://image.tmdb.org/t/p/w500/fYbShpy94q0kbr2wqlZ0KmpcQy7.jpg','2017-12-01',5.3,0),(21935,'Casino Royale','en','Sir James Bond is called back out of retirement to stop SMERSH. In order to trick SMERSH, James thinks up the ultimate plan 