-02-07',5.8,0),(21974,'Burnt','en','Adam Jones is a Chef who destroyed his career with drugs and diva behavior. He cleans up and returns to London, determined to redeem himself by spearheading a top restaurant that can gain three Michelin stars.','https://image.tmdb.org/t/p/w500/iptu4zfvbeULkeuoVkTl2mOqTPS.jpg','2015-10-02',6.5,0),(21975,'The House Bunny','en','Shelley is living a carefree life until a rival gets her tossed out of the Playboy Mansion. With nowhere to go, fate delivers her to the sorority girls from Zeta Alpha Zeta. Unless they can sign a new pledge class, the seven socially clueless women will lose their house to the scheming girls of Phi Iota Mu. In order to accomplish their goal, they need Shelley to teach them the ways of makeup and men; at the same time, Shelley needs some of what the Zetas have - a sense of individuality. The combination leads all the girls to learn how to stop pretending and start being themselves.','https://image.tmdb.org/t/p/w500/4oGGJ824vqIqDtyMvMuK44pDEmx.jpg','2008-08-22',5.7,0),(21976,'Heartbreakers','en','Max and Page are a brilliant mother/daughter con team who have their grift down to a fine science. Max targets wealthy, willing men and marries them. Page then seduces them, and Max catches her husband in the act. Then it\'s off to palimony city and the next easy mark.','https://image.tmdb.org/t/p/w500/bwvec0gRMSpLakcPuxe0RWScNv3.jpg','2001-03-23',6,0),(21977,'Made of Honor','en','Tom and Hannah have been platonic friends for 10 years. He\'s a serial dater, while she wants marriage but hasn\'t found Mr. Right. Just as Tom is starting to think that he is relationship material after all, Hannah gets engaged. When she asks Tom to be her \'maid\' of honor, he reluctantly agrees just so he can attempt to stop the wedding and woo her.','https://image.tmdb.org/t/p/w500/pDg8D0jNqmz7RbCBgblWvmPswHE.jpg','2008-04-30',6.4,0),(21978,'Hush','en','A deaf woman is stalked by a psychotic killer in her secluded home.','https://image.tmdb.org/t/p/w500/zHzBTd502IZf60x8n2g0TB01vPF.jpg','2016-03-12',6.7,0),(21979,'The Manchurian Candidate','en','Near the end of the Korean War, a platoon of U.S. soldiers is captured by communists and brainwashed. Following the war, the platoon is returned home, and Sergeant Raymond Shaw is lauded as a hero by the rest of his platoon. However, the platoon commander, Captain Bennett Marco, finds himself plagued by strange nightmares and soon races to uncover a terrible plot.','https://image.tmdb.org/t/p/w500/2xQ856kd9hw6bB3OnusGyTvvkwB.jpg','1962-10-01',7.6,0),(21980,'Singularity','en','When Elias van Dorne, CEO of the world\'s largest robotics company, introduces his most powerful invention, Kronos-a super-computer designed to end all wars-it determines that humans are the biggest threat and launches a worldwide attack on mankind. A small band of survivors must form an unlikely alliance to survive the greatest artificial intelligence threat man will ever know.','https://image.tmdb.org/t/p/w500/qmAq1fsprWHhFARdpPz0A46ylUS.jpg','2017-11-24',3.7,0),(21981,'Come Away','en','Before Alice went to Wonderland, and before Peter became Pan, they were brother and sister. When their eldest brother dies in a tragic accident, they each seek to save their parents from their downward spirals of despair until finally they are forced to choose between home and imagination, setting the stage for their iconic journeys into Wonderland and Neverland.','https://image.tmdb.org/t/p/w500/vwa0DgR2tHMouIDTJWje2k7Pp30.jpg','2020-11-12',5.8,0),(21982,'32 Malasana Street','es','Malasaña neighborhood, Madrid, Spain, 1976. While political turmoil ravages the streets all over the country, the Olmedo family arrives in the big city and settles into their new apartment. They soon discover that they are not the only ones roaming its corridors.','https://image.tmdb.org/t/p/w500/neCS8vPAtsj9cJDGNaEH76ImSd7.jpg','2020-01-17',6.5,0),(21983,'The Frighteners','en','Once an architect, Frank Bannister now passes himself off as an exorcist of evil spirits. To bolster his facade, he claims his \"special\" gift is the result of a car accident that killed his wife. But what he does not count on is more people dying in the small town where he lives. As he tries to piece together the supernatural mystery of these killings, he falls in love with the wife of one of the victims and deals with a crazy FBI agent.','https://image.tmdb.org/t/p/w500/cOzRjJGmtERahYOtY3R3TMSGFh8.jpg','1996-07-18',6.9,0),(21984,'The King of Staten Island','en','Scott has been a case of arrested development ever since his firefighter father died when he was seven. He\'s now reached his mid-20s having achieved little, chasing a dream of becoming a tattoo artist that seems far out of reach. As his ambitious younger sister heads off to college, Scott is still living with his exhausted ER nurse mother and spends his days smoking weed, hanging with the guys — Oscar, Igor and Richie — and secretly hooking up with his childhood friend Kelsey. But when his mother starts dating a loudmouth firefighter named Ray, it sets off a chain of events that will force Scott to grapple with his grief and take his first tentative steps toward moving forward in life.','https://image.tmdb.org/t/p/w500/zQFjMmE3K9AX5QrBL1SXIxYQ9jz.jpg','2020-07-22',7,0),(21985,'The Beguiled','en','During the Civil War, at a Southern girls’ boarding school, young women take in an injured enemy soldier. As they provide refuge and tend to his wounds, the house is taken over with sexual tension and dangerous rivalries, and taboos are broken in an unexpected turn of events.','https://image.tmdb.org/t/p/w500/uQxfqFAqAvNK5b1wD11b2ycDAVg.jpg','2017-06-23',5.9,0),(21986,'Mainstream','en','A young woman thinks she’s found a path to internet stardom when she starts making YouTube videos with a charismatic stranger  – until the dark side of viral celebrity threatens to ruin them both.','https://image.tmdb.org/t/p/w500/9KXWDsbbp2dcjMNzYRzkuRfrpzc.jpg','2021-05-07'