e son, heads to Hollywood, determined to become a drummer in a rock \'n\' roll band. In L.A., he\'s taken in by Fred after the out-of-work slacker hits E.B. with his car.','https://image.tmdb.org/t/p/w500/hRa9MJTgCbSuL3h2CVPwUdYOWJH.jpg','2011-03-30',5.7,0),(21998,'Rescued by Ruby','en','Chasing his dream to join an elite K-9 unit, a state trooper partners with a fellow underdog: clever but naughty shelter pup Ruby. Based on a true story.','https://image.tmdb.org/t/p/w500/tPlJEodEn0SSV4avo8KSawtlTlN.jpg','2022-03-17',7.5,0),(21999,'Bigbug','fr','Set in the world of 2045, where communities have robotic helpers, a group of suburbanites are locked in for their protection by their household robots, while a rogue, self-aware AI android revolt uprising takes place outside.','https://image.tmdb.org/t/p/w500/jDJOojbuqgnNVGmKgmuYzBpaIgP.jpg','2022-02-11',5.2,0),(22000,'The Pornographer','fr','Jacques Laurent made pornographic films in the 1970s and \'80s, but had put that aside for 20 years. His artistic ideas, born of the \'60s counter-culture, had elevated the entire genre. Older and paunchier, he is now directing a porno again. Jacques\'s artistry clashes with his financially-troubled producer\'s ideas about shooting hard-core sex. Jacques has been estranged from his son Joseph for years, since the son first learned the nature of the family business. They are now speaking again. Joseph and his friends want to recapture the idealism of 1968 with a protest. Separated from his wife, Jacques strives for personal renewal with plans to build a new house by himself...','https://image.tmdb.org/t/p/w500/lbwfC8IqXZYu9JVDRKmj42XCRcw.jpg','2001-10-03',4.5,0),(22001,'Persian Lessons','de','Occupied France, 1942. Gilles is arrested by SS soldiers alongside other Jews and sent to a camp in Germany. He narrowly avoids sudden execution by swearing to the guards that he is not Jewish, but Persian. This lie temporarily saves him, but Gilles gets assigned a life-or-death mission: to teach Farsi to Head of Camp Koch, who dreams of opening a restaurant in Iran once the war is over. Through an ingenious trick, Gilles manages to survive by inventing words of \"Farsi\" every day and teaching them to Koch.','https://image.tmdb.org/t/p/w500/xqLqxwBB3yeV0cXvMA0s2hS0OMN.jpg','2020-04-17',7.7,0),(22002,'Wolf Pack','en','This nature film closely observes wolves through late winter into early spring. Wolf Pack shows this creature’s character, behaviour and life cycle. What emerges is a portrait of the wolf as a disciplined hunter, respected leader and committed parent.','https://image.tmdb.org/t/p/w500/xMN2yfpDi6bKRp4LaSWodDEy5Ha.jpg','1974-01-01',0,0),(22003,'The Dukes of Hazzard: The Beginning','en','When mischievous teenaged cousins Bo and Luke Duke are arrested, both boys are paroled to the care of their Uncle Jesse in Hazzard, sentenced to a summer of hard work. It\'s not long before the Duke boys learn of Boss Hogg\'s plans to foreclose on Uncle Jesse\'s farm. Together, with help from their cousin Daisy, Bo and Luke vow to save the family\'s property and its storied history of producing the best moonshine in all of Hazzard.','https://image.tmdb.org/t/p/w500/1kqpqfIhCvuPRqNuH0ox3T5MBHZ.jpg','2007-03-04',6.3,0),(22004,'Boiling Point','en','A head chef balances multiple personal and professional crises at a popular restaurant in London.','https://image.tmdb.org/t/p/w500/kdkk7OBnIL1peW2zwcAAp6O54Jo.jpg','2021-07-05',7.4,0),(22005,'Land of the Dead','en','The world is full of zombies and the survivors have barricaded themselves inside a walled city to keep out the living dead. As the wealthy hide out in skyscrapers and chaos rules the streets, the rest of the survivors must find a way to stop the evolving zombies from breaking into the city.','https://image.tmdb.org/t/p/w500/34rdmEgsFRDOm8LNDsNkkj0qVlL.jpg','2005-06-18',6.2,0),(22006,'The Secret Garden','en','Mary Lennox is born in India to wealthy British parents who never wanted her. When her parents suddenly die, she is sent back to England to live with her uncle. She meets her sickly cousin, and the two children find a wondrous secret garden lost in the grounds of Misselthwaite Manor.','https://image.tmdb.org/t/p/w500/5MSDwUcqnGodFTvtlLiLKK0XKS.jpg','2020-07-08',6.4,0),(22007,'Michael Jackson: The Life of an Icon','en','See Michael Jackson, one of the most recognizable and popular entertainers of all time, like never before in the feature-length tribute Michael Jackson: The Life of an Icon. Known to millions of fans worldwide for his record-breaking albums, groundbreaking music videos, mesmerizing dance moves and humanitarian efforts, his true story has never really been told...until now. This unprecedented look into the King of Pop\'s fascinating life includes all-new interviews with his mother Katherine Jackson as well as siblings Tito and Rebbie Jackson, family, friends and music legends such as Smokey Robinson, Dionne Warwick and many more.','https://image.tmdb.org/t/p/w500/liPl2d9qx2TWSDKaduUbwC0V1vY.jpg','2011-11-02',7.8,0),(22008,'Thick as Thieves','en','A master thief recruits a notorious thief to help him steal two famous Faberge eggs from an impenetrable vault in an effort to pull off one final job and repay his debt to the Russian mob.','https://image.tmdb.org/t/p/w500/sgRY2ie8koJxfOScMuvzHQ9TuZX.jpg','2009-01-09',5.9,0),(22009,'Bastille Day','en','Michael Mason is an American pickpocket living in Paris who finds himself hunted by the CIA when he steals a bag that contains more than just a wallet. Sean Briar, the field agent on the case, soon realises that Michael is just a pawn in a much bigger game and is also his best asset to uncover a large-scale conspiracy.','https://image.tmdb.org/t/p/w500/lTby7l0zX7xG8Pt0eNrWBrNzdqX.jpg','2016-04-22',6.3,0),(22010,'The Paramedic','es','Unable to face his new reality in a wheelchair, Ángel develops a deadly obsession with the woman who left him and unleashes a sinister revenge plot.','https://image.tmdb.org/t/p/w500/l9