volent curse intent on claiming her daughter.','https://image.tmdb.org/t/p/w500/k8Oj2YlFKbwj1SNKZcb5Fw1Yosj.jpg','2020-10-02',5.4,0),(22023,'Think Like a Man Too','en','All the couples are back for a wedding in Las Vegas, but plans for a romantic weekend go awry when their various misadventures get them into some compromising situations that threaten to derail the big event.','https://image.tmdb.org/t/p/w500/bsKfhf0y9Zx7h4j5GHu1JANpKwl.jpg','2014-06-20',6.4,0),(22024,'A Thousand Words','en','Jack McCall is a fast-talking literary agent, who can close any deal, any time, any way. He has set his sights on New Age guru Dr. Sinja for his own selfish purposes. But Dr. Sinja is on to him, and Jack’s life comes unglued after a magical Bodhi tree mysteriously appears in his backyard. With every word Jack speaks, a leaf falls from the tree and he realizes that when the last leaf falls, both he and the tree are toast. Words have never failed Jack McCall, but now he’s got to stop talking and conjure up some outrageous ways to communicate or he’s a goner.','https://image.tmdb.org/t/p/w500/4BoeDiKFqKwq4mfU8ITDLglFyoc.jpg','2012-03-07',6.1,0),(22025,'The Invincible Iron Man','en','When a cocky industrialist\'s efforts to raise an ancient Chinese temple leads him to be seriously wounded and captured by enemy forces, he must use his ideas for a revolutionary power armor in order to fight back as a superhero.','https://image.tmdb.org/t/p/w500/eebNTSRa5Hh5skPKGdGJIJpo9Ls.jpg','2007-01-23',6.1,0),(22026,'Vehicle 19','en','A parolee becomes the target of a massive police manhunt after inadvertently picking up a rental car with a female whistleblower tied up in the trunk. Now, as the police attempt to silence the woman before she can testify about the city\'s rampant corruption, the ex-con who just regained his freedom must defend her life, and clear his own name.','https://image.tmdb.org/t/p/w500/vRZobS1s3ojOpLFUbFVb2k1qDQI.jpg','2013-03-07',5.3,0),(22027,'The Conference','de','On January 20, 1942, the Wannsee Conference takes place in Berlin, a meeting that had only one item on the agenda: The Final Solution, the organization of the systematic mass murder of eleven million European Jews.','https://image.tmdb.org/t/p/w500/55IkZ0dU8JA4400NA5c4YbM51lF.jpg','2022-05-06',7.2,0),(22028,'Death Wish II','en','Paul Kersey is again a vigilante trying to find five punks who murdered his housekeeper and daughter in Los Angeles.','https://image.tmdb.org/t/p/w500/1bhSCZAifl229B1vCLCiE9BZp7l.jpg','1982-02-20',6.2,0),(22029,'The Thomas Crown Affair','en','Young businessman, Thomas Crown is bored and decides to plan a robbery and assigns a professional agent with the right information to the job. However, Crown is soon betrayed yet cannot blow his cover because he’s in love.','https://image.tmdb.org/t/p/w500/oODAwa2AK3fXvK93GCbq7dFLZPi.jpg','1968-06-26',6.9,0),(22030,'The Assassination of Jesse James by the Coward Robert Ford','en','Outlaw Jesse James is rumored to be the \'fastest gun in the West\'. An eager recruit into James\' notorious gang, Robert Ford eventually grows jealous of the famed outlaw and, when Robert and his brother sense an opportunity to kill James, their murderous action elevates their target to near mythical status.','https://image.tmdb.org/t/p/w500/9QnHSUMXiKFO4AVxbzpstbnH0T5.jpg','2007-09-07',7.1,0),(22031,'Books of Blood','en','A journey into uncharted and forbidden territory through three tales tangled in space and time.','https://image.tmdb.org/t/p/w500/bXLVZGgLgd7OwbfP6fC5GCfrxuD.jpg','2020-10-07',6.5,0),(22032,'Antares','de','A deadly car crash sets off three parallel stories of women at crisis points, faltering behind the doors of the same, plain Vienna apartment block.','https://image.tmdb.org/t/p/w500/6JZa1B9d6kMkqkDTwtpX2Y6V17z.jpg','2004-12-03',6.1,0),(22033,'Diary of a Sex Addict','en','A restaurant owner leads a double life.','https://image.tmdb.org/t/p/w500/oOkQLPTp6EyvTfQ5OTCUqeQ90pZ.jpg','2001-11-23',5.7,0),(22034,'Star Tre