nds up stranded on a deserted island with her after their plane crashes. The pair avoid each other at first, until they\'re forced to team up to escape from the island -- and some pirates who want their heads.','https://image.tmdb.org/t/p/w500/fzWrrCzRa16v51TXAUuT6Wendw7.jpg','1998-06-12',6,0),(22045,'Changeling','en','Christine Collins is overjoyed when her kidnapped son is brought back home. But when Christine suspects that the boy returned to her isn\'t her child, the police captain has her committed to an asylum.','https://image.tmdb.org/t/p/w500/dsCAryPlgLlpZu80hhLTwQHRIpU.jpg','2008-01-30',7.6,0),(22046,'Invictus','en','Newly elected President Nelson Mandela knows his nation remains racially and economically divided in the wake of apartheid. Believing he can bring his people together through the universal language of sport, Mandela rallies South Africa\'s rugby team as they make their historic run to the 1995 Rugby World Cup Championship match.','https://image.tmdb.org/t/p/w500/cNUoXM8dtg5mRt90GLrAHBP9IGE.jpg','2009-12-10',7.2,0),(22047,'Cry Macho','en','Mike Milo, a one-time rodeo star and washed-up horse breeder, takes a job from an ex-boss to bring the man\'s young son home from Mexico.','https://image.tmdb.org/t/p/w500/bzJBmh8U5ofExJara4nrdqlW8f3.jpg','2021-09-16',6,0),(22048,'88','en','A young woman comes to in a roadside diner with no idea where she is or how she got there. Split between two timelines, she gets taken on a violent journey as she seeks out the person responsible for her lover\'s death.','https://image.tmdb.org/t/p/w500/kbCZDINnj4rHhoZZUeXTsviYUkl.jpg','2015-01-06',5.1,0),(22049,'Monster High: Boo York, Boo York','en','It\'s fright lights, big city when the Monster High ghouls head to Boo York! Cleo de Nile is invited to attend a gancy gala celebrating the return of the magical comet and, of course, she brings along her beast friends. But their trip isn\'t all fun and frightseeing because Nefera, Cleo\'s sister, uses the comet\'s power for 