ices.','https://image.tmdb.org/t/p/w500/oOQ3PS8wp5Iezqc5LChOq2S97Jl.jpg','2005-01-17',6.3,0),(22058,'The Big Boss','zh','Chen is a city boy who moves with his cousins to work at an ice factory. He does this with a family promise never to get involved in any fight. However, when members of his family begin disappearing after meeting the management of the factory, the resulting mystery and pressures force him to break that vow and take on the villainy of the Big Boss.','https://image.tmdb.org/t/p/w500/9VFYDWYnAhXAgyqgs94lwNmMBbk.jpg','1971-10-03',7.2,0),(22059,'Bruce Lee: A Warrior\'s Journey','en','Legendary martial artist Bruce Lee is the subject of this thoughtful documentary by Lee aficionado John Little. Using interviews, behind-the-scenes footage and action sequences from Lee\'s last (unfinished) film, Game of Death, Little paints a textured, complex portrait of the world\'s most famous action hero','https://image.tmdb.org/t/p/w500/yvm10wHnOQaGl9a4X9KnDHaoJ8W.jpg','2000-10-22',7.5,0),(22060,'The Grudge 3','en','Jake Kimble, the sole survivor of the Chicago massacre, is killed while in solitary confinement. His doctor begins investigating the claims he made about a long-haired woman in white, as a mysterious Japanese woman arrives at his old apartment building to help them get rid of the curse.','https://image.tmdb.org/t/p/w500/7ANoOtrJKtivZmxao0m2rC5Pm9i.jpg','2009-05-12',5.4,0),(22061,'Cherish & Ruelle','id','About a fashion designer named Cherish who wants to buy back her childhood home. Helped by Ruelle, her best friend, she also accepts the offer of a mysterious man called by the Dealer to steal a wedding dress worth tens of billions of rupiah belonging to a controversial businessman named Richella. Can they do it?','https://image.tmdb.org/t/p/w500/AgiZuJ77TWleTbh82braAtCfVaD.jpg','2023-02-10',5,0),(22062,'Benediction','en','Poet Siegfried Sassoon survived the horrors of fighting in the First World War and was decorated for his bravery, but became a vocal cr