ory about the friendship developed between a Yukon gold hunter and the mixed dog-wolf he rescues from the hands of a man who mistreats him.','https://image.tmdb.org/t/p/w500/27wg0rVZW8hX7nWeHCwTf9DygGc.jpg','1991-01-18',6.7,0),(22069,'K.G.F: Chapter 2','kn','The blood-soaked land of Kolar Gold Fields (KGF) has a new overlord now - Rocky, whose name strikes fear in the heart of his foes. His allies look up to Rocky as their Savior, the government sees him as a threat to law and order; enemies are clamoring for revenge and conspiring for his downfall. Bloodier battles and darker days await as Rocky continues on his quest for unchallenged supremacy.','https://image.tmdb.org/t/p/w500/khNVygolU0TxLIDWff5tQlAhZ23.jpg','2022-04-14',7.7,0),(22070,'Pornstar 2: Pangalawang Putok','tl','The queens of bomba movies Alma Moreno, Ara Mina, Maui Taylor and Rosanna Roces are back to search for the next Philippine pornstar featuring new breed of sexy temptresses: Sab Aggabao, Cara Gonzales, Ayana Misola, Stephanie Raz.','https://image.tmdb.org/t/p/w500/A1FUQj9vtBBheqshwcrMfsvCOLI.jpg','2021-12-03',7,0),(22071,'Office Space','en','A depressed white-collar worker tries hypnotherapy, only to find himself in a perpetual state of devil-may-care bliss that prompts him to start living by his own rules, and hatch a hapless attempt to embezzle money from his soul-killing employers.','https://image.tmdb.org/t/p/w500/fiB7DY9mATGFOCTd4cgK6k2Wzr9.jpg','1999-02-19',7.4,0),(22072,'Dennis the Menace Strikes Again!','en','Barricade the doors. Lock the windows. Because he\'s baaaack. That one-boy wrecking crew, Dennis the Menace, returns for more mischief and mayhem. Based on the comic strip and TV show about a mischievous little boy with a gift for the potentially lethal prank.','https://image.tmdb.org/t/p/w500/c6fxRpHNdSA3yv8prMo1sNzOcgF.jpg','1998-07-14',5.4,0),(22073,'Passage of My Youth','zh','The warm and tearful stories that happened among elite students while studying abroad and in the event t