rker takes a job at a powerful Internet corporation, quickly rises up the company\'s ranks, and soon finds herself in a perilous situation concerning privacy, surveillance and freedom. She comes to learn that her decisions and actions will determine the future of humanity.','https://image.tmdb.org/t/p/w500/bQVqd5rWrx5GbXhJNuvKy4Viz6j.jpg','2017-04-27',5.5,0),(22080,'Don\'t Knock Twice','en','A mother desperate to reconnect with her troubled daughter becomes embroiled in the urban legend of a demonic witch.','https://image.tmdb.org/t/p/w500/rxiz9zHLrqC5JfKVPbkKBboiSzI.jpg','2016-11-13',5.5,0),(22081,'La Belle Noiseuse','fr','The former famous painter Frenhofer lives quietly with his wife on a countryside residence in the French Provence. When the young artist Nicolas visits him with his girlfriend Marianne, Frenhofer decides to start again the work on a painting he long ago stopped: La Belle Noiseuse. And he wants Marianne as model.','https://image.tmdb.org/t/p/w500/kmEZ0XnfDxjD7GE3eHNc8bXLCwL.jpg','1991-09-04',7.3,0),(22082,'The Scorpion King 4: Quest for Power','en','When he is betrayed by a trusted friend, Mathayus must marshal all his strength and cunning to outwit a formidable opponent who will stop at nothing to unlock a supreme ancient power.','https://image.tmdb.org/t/p/w500/5GISNwtHWbmYJdbFHMpLoaotYhL.jpg','2015-01-09',5.1,0),(22083,'Raavanan','ta','After inspector Dev stirs the reign of Veeraiya, a tribal outlaw, the latter responds by kidnapping his wife, Ragini. While she tries to escape from him, Dev fights many resistances to find her.','https://image.tmdb.org/t/p/w500/Ad1cI1dIX6ulghvcebaa9NUHxuu.jpg','2010-06-18',6.9,0),(22084,'Starsky & Hutch','en','Join uptight David Starsky and laid-back Ken \"Hutch\" Hutchinson as they\'re paired for the first time as undercover cops. The new partners must overcome their differences to solve an important case with help from street informant Huggy Bear and persuasive criminal Reese Feldman.','https://image.tmdb.org/