r her nest when her egg is stolen. Now they must outrun and kill the deadly piranhaconda as well as stop the mad scientist who stole the egg - before they all become dinner.','https://image.tmdb.org/t/p/w500/oqgQghwDwyv4PzyaoMUnhgtiCjt.jpg','2012-06-16',5.2,0),(22095,'American Traitor: The Trial of Axis Sally','en','The life of American woman Mildred Gillars and her lawyer, who struggles to redeem her reputation. Dubbed “Axis Sally” for broadcasting Nazi propaganda to American troops during World War II, Mildred’s story exposes the dark underbelly of the Third Reich\'s hate-filled propaganda machine, her eventual capture in Berlin, and subsequent trial for treason against the United States after the war.','https://image.tmdb.org/t/p/w500/eB6IprCYs6EQE9I6EBScsa7Bmad.jpg','2021-05-28',6,0),(22096,'Frankenstein','en','Dr. Henry Frankenstein attempts to create life by assembling a creature from body parts of the deceased. Aided by his loyal misshapen assistant, Fritz, Frankenstein succeeds in animating his monster, but, confused and traumatized, it escapes into the countryside and begins to wreak havoc. Frankenstein searches for the elusive being and eventually must confront his tormented creation.','https://image.tmdb.org/t/p/w500/gKaSFyd6HMTkXqU3UVVNWhVUiiO.jpg','1931-11-19',7.5,0),(22097,'For Your Eyes Only','en','A British spy ship has sunk and on board was a hi-tech encryption device. James Bond is sent to find the device that holds British launching instructions before the enemy Soviets get to it first.','https://image.tmdb.org/t/p/w500/z57s6bpnYqokqr5HVNOBQFv5e1j.jpg','1981-06-23',6.5,0),(22098,'Shaun the Sheep Movie','en','When Shaun decides to take the day off and have some fun, he gets a little more action than he bargained for. A mix up with the Farmer, a caravan and a very steep hill lead them all to the Big City and it\'s up to Shaun and the flock to return everyone safely to the green grass of home.','https://image.tmdb.org/t/p/w500/dhVYlfMNc2bfXPB83LLL00I4l9n.jpg','2015-02-05',7,0),(22099,'The Bye Bye Man','en','When three college students move into an old house off campus, they unwittingly unleash a supernatural entity known as The Bye Bye Man, who comes to prey upon them once they discover his name. The friends must try to save each other, all the while keeping The Bye Bye Man\'s existence a secret to save others from the same deadly fate.','https://image.tmdb.org/t/p/w500/bape74Eeli5NJ6x4UKuUr604xXh.jpg','2017-01-12',5.2,0),(22100,'Camp X-Ray','en','A young woman joins the military to be part of something bigger than herself and her small-town roots. Instead, she ends up as a new guard at Guantanamo Bay, where her mission is far from black and white. Surrounded by hostile jihadists and aggressive squadmates, she strikes up an unusual friendship with one of the detainees.','https://image.tmdb.org/t/p/w500/aqNzRiaEsfv567Ji9njJofblRBE.jpg','2014-10-17',6.8,0),(22101,'Land','en','Edee, in the aftermath of an unfathomable event, finds herself unable to stay connected to the world she once knew and in the face of that uncertainty, retreats to the magnificent, but unforgiving, wilds of the Rockies. After a local hunter brings her back from the brink of death, she must find a way to live again.','https://image.tmdb.org/t/p/w500/6pYhDPzYPGKvDYpxdf0IUE3RDAS.jpg','2021-02-12',6.8,0),(22102,'The Gods Must Be Crazy II','en','Xixo is back again. This time, his children accidentally stow away on a fast-moving poachers\' truck, unable to get off, and Xixo sets out to rescue them. Along the way, he encounters a couple of soldiers trying to capture each other and a pilot and passenger of a small plane, who are each having a few problems of their own.','https://image.tmdb.org/t/p/w500/ldb5M9LOawvaqvY7NSfsB66QLki.jpg','1989-07-01',7,0),(22103,'Tom and Jerry: A Nutcracker Tale','en','A holiday themed animated direct-to-video film starring Academy Award-winners, Tom and Jerry. It uses a good deal of Tchaikovsky\'s famous ballet The Nutcracker as background music. This film would be the last animated production for Tom and Jerry co-creator, Joseph Barbera, who would die on December 18, 2006. The film features all of the exaggerated violence usually found in Tom and Jerry.','https://image.tmdb.org/t/p/w500/q5cmiZHBLZBsDGCugyNUJiyxuJg.jpg','2007-10-02',6.9,0),(22104,'Philadelphia','en','Two competing lawyers join forces to sue a prestigious law firm for AIDS discrimination. As their unlikely friendship develops their courage overcomes the prejudice and corruption of their powerful adversaries.','https://image.tmdb.org/t/p/w500/tFe5Yoo5zT495okA49bq1vPPkiV.jpg','1993-12-22',7.7,0),(22105,'Major Payne','en','Major Benson Winifred Payne is being discharged from the Marines. Payne is a killin\' machine, but the wars of the world are no longer fought on the battlefield. A career Marine, he has no idea what to do as a civilian, so his commander finds him a job - commanding officer of a local school\'s JROTC program, a bunch of ragtag losers with no hope.','https://image.tmdb.org/t/p/w500/kWHx5eq7PELkF3If7LrrhuBskRG.jpg','1995-03-24',6.4,0),(22106,'The Guns of Navarone','en','A team of allied saboteurs are assigned an impossible mission: infiltrate an impregnable Nazi-held island and destroy the two enormous long-range field guns that prevent the rescue of 2,000 trapped British soldiers.','https://image.tmdb.org/t/p/w500/rBnNHKhSHFuac0I6qPYiVLJ6ohy.jpg','1961-04-27',7.3,0),(22107,'Cyborg','en','A martial artist hunts a killer in a plague-infested urban dump of the future.','https://image.tmdb.org/t/p/w500/nOspcG8HP6KPdMvzezavRbzYCEw.jpg','1989-04-07',5.6,0),(22108,'Sharpay\'s Fabulous Adventure','en','After a talent scout spots her performing with her dog Boi at a charity gala, Sharpay Evans sets off for the bright lights of NYC, convinced instant fame and fortune are in the bag. But theatre\'s a dog-eat-dog world. Fortunately, Sharpay also meets Peyton, a handsome student filmmaker who finds Sharpay nearly as fascinating as she finds herself.','https://image.tmdb.org/t/p/w500/aPtBzBKCCvByXue1AZrG2lrxm4l.jpg','2011-04-19',6,0),(22109,'My Father\'s Violin','tr','Through their shared grief and connection to music, an orphaned girl bonds with her emotionally aloof, successful violinist uncle.','https://image.tmdb.org/t/p/w500/bwvoSRyXRRqtpvoHYhySQk2U4EM.jpg','2022-01-21',7.9,0),(22110,'The Cable Guy','en','When recently single Steven moves into his new apartment, cable guy Chip comes to hook him up—and doesn\'t let go. Initially, Chip is just overzealous in his desire to be Steven\'s pal, but when Steven tries to end the \'friendship\', Chip shows his dark side. He begins stalking Steven, who\'s left to fend for himself because no one else can believe Chip\'s capable of such behaviour.','https://image.tmdb.org/t/p/w500/5cZySBvy41eHTD5LyQn48aP444k.jpg','1996-06-10',6,0),(22111,'Stomp the Yard 2: Homecoming','en','Chance Harris looks to find a balance between his school, work, relationships and opportunity to perform at the nationally televised step competition during homecoming weekend at Truth University.','https://image.tmdb.org/t/p/w500/ttwEygvi7j1TNhDTvfBROEHtHEY.jpg','2010-10-10',5.5,0),(22112,'Maya the Bee Movie','en','Freshly hatched bee Maya is a little whirlwind and won\'t follow the rules of the hive. One of these rules is not to trust the hornets that live beyond the meadow. When the Royal Jelly is stolen, the hornets are suspected and Maya is thought to be their accomplice. No one believes that she is the innocent victim and no one will stand by her except for her good-natured and best friend Willy. After a long and eventful journey to the hornets hive Maya and Willy soon discover the true culprit and the two friends finally bond with the other residents of the opulent meadow.','https://image.tmdb.org/t/p/w500/pMQ88CvnQroSjxk4IhM7YNbcjTx.jpg','2014-09-11',6.2,0),(22113,'Si Saben Como me pongo Pa Que Me Invitan? 2','es','The El Encanto resort once again hosts a retreat for four couples -- including a liar, a sex addict and a thief -- seeking to fix their relationships.','https://image.tmdb.org/t/p/w500/bFRxPAiyA7dhTLrEcitAjLL02BJ.jpg','2022-07-13',3,0),(22114,'You Again','en','History -- make that high school -- may repeat itself when Marni learns that Joanna, the mean girl from her past, is set to be her sister-in-law. Before the wedding bells toll, Marni must show her brother that a tiger doesn\'t change its stripes. On Marni\'s side is her mother, while Joanna\'s backed by her wealthy aunt.','https://image.tmdb.org/t/p/w500/9qI5JE6yjmtakTankuDOMZ1vgEx.jpg','2010-09-24',6.3,0),(22115,'The Unfamiliar','en','A British Army doctor comes back from a war, thinking that she has PTSD only to discover that there is a more daunting malevolence at work making the life that she knew unfamiliar.','https://image.tmdb.org/t/p/w500/Xt37loPwHjipC1qaCbfLfDcFu4.jpg','2020-08-21',5.9,0),(22116,'The Banker','en','In the 1960s, two entrepreneurs hatch an ingenious business plan to fight for housing integration—and equal access to the American Dream.','https://image.tmdb.org/t/p/w500/biXzsw22U6vSd0XktmZwAOc4uik.jpg','2020-03-06',7.6,0),(22117,'The Mermaid: Lake of the Dead','ru','An evil Mermaid falls in love with Marina\'s fiancé Roman and aims to keep him away from Marina in her Kingdom of Death under water. The Mermaid is a young woman who drowned a few centuries ago. Marina only has one week to overcome her fear of the dark water, to remain human in the deathly fight with the monsters and not to become one herself.','https://image.tmdb.org/t/p/w500/gGFZ84plg0TPM737j8ccpseh96l.jpg','2018-07-12',6.2,0),(22118,'End of Watch','en','Two young officers are marked for death after confiscating a small cache of money and firearms from the members of a notorious cartel during a routine traffic stop.','https://image.tmdb.org/t/p/w500/pDeVKQICkcdwwjHxGj0MeS14YJ6.jpg','2012-09-20',7.3,0),(22119,'Mercenaries','en','A diplomatic official is captured and imprisoned while touring a war zone, so a team of elite female commandos is assembled to infiltrate a women\'s prison for a daring rescue.','https://image.tmdb.org/t/p/w500/eba3J71GIIXncTVzS3fMqjdMzfz.jpg','2014-08-05',5.3,0),(22120,'Archive','en','2038: George Almore is working on a true human-equivalent AI, and his latest prototype is almost ready. This sensitive phase is also the riskiest as he has a goal that must be hidden at all costs—being reunited with his dead wife.','https://image.tmdb.org/t/p/w500/eDnHgozW8vfOaLHzfpHluf1GZCW.jpg','2020-08-13',6.2,0),(22121,'Censor','en','Film censor Enid takes pride in her meticulous work, guarding unsuspecting audiences from the deleterious effects of watching the gore-filled movies she pores over. Her sense of duty to protect is amplified by guilt over her inability to recall details of the long-ago disappearance of her sister. When Enid is assigned to review a disturbing film from the archive that echoes her hazy childhood memories, she begins to unravel how this eerie work might be tied to her past.','https://image.tmdb.org/t/p/w500/1FOEEtGFPp5cgpLfPQVMB0UNVpI.jpg','2021-06-11',5.8,0),(22122,'The Visitors II: The Corridors of Time','fr','The sequel to The Visitors reunites us with those lovable ruffians from the French Medieval ages who - through magic - are transported into the present, with often drastic consequences. Godefroy de Montmirail travels to today to recover the missing family jewels and a sacred relic, guarantor of his wife-to-be\'s fertility. The confrontation between Godefroy\'s repellent servant Jack the Crack and his descendent, the effete Jacquart, present-day owner of the chateau, further complicates the matter.','https://image.tmdb.org/t/p/w500/c1xMb4GfTuyKSRUoeewBF27dtKa.jpg','1998-02-11',6,0),(22123,'Homeward Bound: The Incredible Journey','en','Remake of the popular Disney classic, this time featuring some well known voices as two dogs and a cat trek across America encountering all sorts of adventures in the quest to be reunited with their owners.','https://image.tmdb.org/t/p/w500/el6dJEpK97OJRQiQhuiSGk2jkV5.jpg','1993-02-03',6.9,0),(22124,'Candyman','en','The Candyman, a murderous soul with a hook for a hand, is accidentally summoned to reality by a skeptic grad student researching the monster\'s myth.','https://image.tmdb.org/t/p/w500/n38YbNqUf5KWpMJFc4X3t0rlhg5.jpg','1992-10-16',6.6,0),(22125,'Godzilla, King of the Monsters!','en','During an assignment, foreign correspondent Steve Martin spends a layover in Tokyo and is caught amid the rampage of an unstoppable prehistoric monster the Japanese call \'Godzilla\'. The only hope for both Japan and the world lies on a secret weapon, which may prove more destructive than the monster itself.','https://image.tmdb.org/t/p/w500/19RDmhX6LtzMxv0KXXAU1IBIvvA.jpg','1956-04-27',6.6,0),(22126,'Empire of the Sun','en','Jamie Graham, a privileged English boy, is living in Shanghai when the Japanese invade and force all foreigners into prison camps. Jamie is captured with an American sailor, who looks out for him while they are in the camp together. Even though he is separated from his parents and in a hostile environment, Jamie maintains his dignity and youthful spirits, providing a beacon of hope for the others held captive with him.','https://image.tmdb.org/t/p/w500/gEaCzjwHoPgyQFcwHql7o5YLHAU.jpg','1987-12-09',7.5,0),(22127,'Lost in Space','en','The prospects for continuing life on Earth in the year 2058 are grim. So the Robinsons are launched into space to colonize Alpha Prime, the only other inhabitable planet in the galaxy. But when a stowaway sabotages the mission, the Robinsons find themselves hurtling through uncharted space.','https://image.tmdb.org/t/p/w500/4miEpZmUOMqV8P0T6oq5HVBiVHw.jpg','1998-04-03',5.4,0),(22128,'Everly','en','After she betrays a powerful mob boss, a woman matches wits and weaponry with a legion of killers who are out to collect the bounty on the heads of her and her family.','https://image.tmdb.org/t/p/w500/2As9fPVTZ1jF6uaTweiVw1RRFDD.jpg','2014-09-20',5.4,0),(22129,'Dogtanian and the Three Muskehounds','es','France, 17th century, under the reign of Louis XIII. Dogtanian is an impetuous and innocent peasant from Gascony, as well as a skilled swordsman, who travels to Paris with the purpose of making his dream come true: to join the Corps of Muskehounds of the Royal Guard.','https://image.tmdb.org/t/p/w500/tzc6gzLENIujnRIx7rUjN1FIhn5.jpg','2021-06-25',6.8,0),(22130,'The Red Sea Diving Resort','en','Sudan, East Africa, 1980. A team of Israeli Mossad agents plans to rescue and transfer thousands of Ethiopian Jews to Israel. To do so, and to avoid raising suspicions from the inquisitive and ruthless authorities, they establish as a cover a fake diving resort by the Red Sea.','https://image.tmdb.org/t/p/w500/bTgd1QQFTKdxESevtffAvIvCnz2.jpg','2019-07-28',6.9,0),(22131,'Along Came Polly','en','Reuben Feffer is a guy who\'s spent his entire life playing it safe. Polly Prince is irresistible as a free-spirit who lives for the thrill of the moment. When these two comically mismatched souls collide, Reuben\'s world is turned upside down, as he makes an uproarious attempt to change his life from middle-of-the-road to totally-out-there.','https://image.tmdb.org/t/p/w500/ieTSn8YTsHoPK8GNf2J9eIkP5wo.jpg','2004-01-16',6,0),(22132,'In the Name of the King 2: Two Worlds','en','Granger, an ex-Special Forces soldier gets thrown back to medieval times to fulfill an ancient prophecy. Venturing through the now war torn Kingdom of Ehb, he teams up with an unlikely band of allies with the goal of slaying the leader of the \"Dark Ones\". Fighting against all odds, they must free the land from the grasp of the evil tyrant Raven and save the world.','https://image.tmdb.org/t/p/w500/kM9hjeGLtPZi9ExuBVwIFYrQbx0.jpg','2011-11-03',4,0),(22133,'Rebel Without a Cause','en','After moving to a new town, troublemaking teen Jim Stark is supposed to have a clean slate, although being the new kid in town brings its own problems. While searching for some stability, Stark forms a bond with a disturbed classmate, Plato, and falls for local girl Judy. However, Judy is the girlfriend of neighborhood tough, Buzz. When Buzz violently confronts Jim and challenges him to a drag race, the new kid\'s real troubles begin.','https://image.tmdb.org/t/p/w500/n0oJB5fhcUth9ZbHziwsFuR38gT.jpg','1955-10-29',7.6,0),(22134,'Finding You','en','Finley, a talented aspiring violinist, meets Beckett, a famous young movie star, on the way to her college semester abroad program in a small coastal village in Ireland. An unexpected romance emerges as the heartthrob Beckett leads the uptight Finley on an adventurous reawakening, and she emboldens him to take charge of his future, until the pressures of his stardom get in the way.','https://image.tmdb.org/t/p/w500/mRSsYtYcbhNAfHBp3ha1Nr65agi.jpg','2021-05-13',7,0),(22135,'Greystoke: The Legend of Tarzan, Lord of the Apes','en','A shipping disaster in the 19th Century has stranded a man and woman in the wilds of Africa. The lady is pregnant, and gives birth to a son in their tree house. Soon after, a family of apes stumble across the house and in the ensuing panic, both parents are killed. A female ape takes the tiny boy as a replacement for her own dead infant, and raises him as her son. Twenty years later, Captain Phillippe D\'Arnot discovers the man who thinks he is an ape. Evidence in the tree house leads him to believe that he is the direct descendant of the Earl of Greystoke, and thus takes it upon himself to return the man to civilization.','https://image.tmdb.org/t/p/w500/rdtEIdzqJTVhSLsjuR4U9t1KKxp.jpg','1984-03-30',6.4,0),(22136,'History of the World: Part I','en','An uproarious version of history that proves nothing is sacred – not even the Roman Empire, the French Revolution and the Spanish Inquisition.','https://image.tmdb.org/t/p/w500/6iAl78qZHT65erPXr2YW6Y54wlY.jpg','1981-06-12',6.8,0),(22137,'The Monkey King 2','zh','Taking place 500 years after the Havoc in Heaven, the Tang Priest is appointed by Buddha to go to the West to fetch the sacred scriptures, only to accidentally free the Monkey King. With Lady White aiming to break up the team assembled to defeat her, the Monkey King must fight in order to save his world!','https://image.tmdb.org/t/p/w500/kcV6J5gD4znVLXMQ04CVLdkA2Gb.jpg','2016-01-22',5.8,0);
INSERT INTO `movies` VALUES (22138,'Little Women','en','With their father away as a chaplain in the Civil War, Jo, Meg, Beth and Amy grow up with their mother in somewhat reduced circumstances. They are a close family who inevitably have their squabbles and tragedies. But the bond holds even when, later, male friends start to become a part of the household.','https://image.tmdb.org/t/p/w500/1ZzH1XMcKAe5NdrKL5MfcqZHHsZ.jpg','1994-12-21',7.3,0),(22139,'Rio Lobo','en','After the Civil War, Cord McNally searches for the traitor whose perfidy caused the defeat of McNally\'s unit and the loss of a close friend.','https://image.tmdb.org/t/p/w500/2vlpjEE5GxJr7CiURQ4e2DWybkw.jpg','1970-04-01',6.4,0),(22140,'Downfall','de','In April of 1945, Germany stands at the brink of defeat with the Russian Army closing in from the east and the Allied Expeditionary Force attacking from the west. In Berlin, capital of the Third Reich, Adolf Hitler proclaims that Germany will still achieve victory and orders his generals and advisers to fight to the last man. When the end finally does come, and Hitler lies dead by his own hand, what is left of his military must find a way to end the killing that is the Battle of Berlin, and lay down their arms in surrender.','https://image.tmdb.org/t/p/w500/cP1ElGjBhbZAAqmueXjHDKlSwiP.jpg','2004-09-16',7.8,0),(22141,'Anthropoid','en','In December 1941, Czech soldiers Jozef Gabčík and Jan Kubiš parachute into their occupied homeland to assassinate Nazi officer Reinhard Heydrich.','https://image.tmdb.org/t/p/w500/5hUghRVVkBYufftfNQkGevY5AmE.jpg','2016-08-12',7.1,0),(22142,'Christmas with the Kranks','en','When their only daughter Blair leaves the family nest, Luther and Nora Krank decide to book an island cruise to beat the yuletide blues and just skip the holidays. But their decision to boycott tradition has the whole neighborhood in an uproar, and when Blair calls on Christmas Eve to announce a surprise visit with her new fiancée, the Kranks have just twelve hours to perform a miracle and pull themselves and their neighbors together to throw the best celebration ever!','https://image.tmdb.org/t/p/w500/q866vL3KhAjbkZH1enT7AoxmRHx.jpg','2004-11-24',6.2,0),(22143,'Justice League Dark','en','When innocent civilians begin committing unthinkable crimes across Metropolis, Gotham City and beyond, Batman must call upon mystical counterparts to eradicate this demonic threat to the planet; enter Justice League Dark. This team of Dark Arts specialists must unravel the mystery of Earth\'s supernatural plague and contend with the rising, powerful villainous forces behind the siege—before it\'s too late for all of mankind.','https://image.tmdb.org/t/p/w500/gWcTaDFXDrOAPfVzfBFz0Aya5BE.jpg','2017-01-24',7.3,0),(22144,'Barbarella','en','In the far future, a highly sexual woman is tasked with finding and stopping the evil Durand-Durand. Along the way she encounters various unusual people.','https://image.tmdb.org/t/p/w500/vHxdpF8fjY6JMvDplzyhA6noIXT.jpg','1968-10-10',6,0),(22145,'Wanderlust','en','Rattled by sudden unemployment, a Manhattan couple surveys alternative living options, ultimately deciding to experiment with living on a rural commune where free love rules.','https://image.tmdb.org/t/p/w500/hH1Bla0W4YIn9sdd9NwODzDCcE4.jpg','2012-02-23',5.5,0),(22146,'The Family Man','en','Jack\'s lavish, fast-paced lifestyle changes one Christmas night when he stumbles into a grocery store holdup and disarms the gunman. The next morning he wakes up in bed lying next to Kate, his college sweetheart he left in order to pursue his career, and to the horrifying discovery that his former life no longer exists. As he stumbles through this alternate suburban universe, Jack finds himself at a crossroad where he must choose between his high-power career and the woman he loves.','https://image.tmdb.org/t/p/w500/zsedbiD7i2SepxIxb0F3U95mqyH.jpg','2000-12-12',6.8,0),(22147,'From Dusk Till Dawn 2: Texas Blood Money','en','A gang of bank-robbing misfits heads to Mexico with the blueprints for the perfect million-dollar heist, but when one of the crooks wanders into the wrong bar... and crosses the wrong vampire... the thieving cohorts develop a thirst for blood!','https://image.tmdb.org/t/p/w500/in11KZuaVuJnxVBipxYocDqMQbW.jpg','1999-03-16',4.5,0),(22148,'Taxi 3','fr','A gang of thieves calling themselves the Santa Claus Gang are wreaking havoc, and the police can\'t keep up. Police Captain Gilbert is distracted by a Chinese reporter writing a story on his squad, and taxi driver Daniel is in the midst of a relationship crisis. After a string of mistakes in which the thieves outsmart the police time and time again, Daniel and his super-taxi pitch in.','https://image.tmdb.org/t/p/w500/6Yk3O5mNIYpIKIKaB2l4TJBDdlS.jpg','2003-01-29',5.7,0),(22149,'The Darkest Hour','en','In Moscow, five young people lead the charge against an alien race which has attacked Earth via our power supply.','https://image.tmdb.org/t/p/w500/5Ao4qAFbjP7fcFOOdMNvQEnl0Yr.jpg','2011-12-22',5.3,0),(22150,'The Debt Collector','en','A classically-trained martial artist goes to work as a debt collector for the mob. The job seems easy enough, until one “client” pulls him into a situation deeper than could ever be expected.','https://image.tmdb.org/t/p/w500/5XyuUPoIeEf3guWLQW9lATON84v.jpg','2018-06-05',5.9,0),(22151,'The Odds','en','A young woman enlists in an underground game of pain endurance in the hope of winning the million dollar prize. She soon learns the real opponent is the man who\'s running the game, as he employs horrific methods to manipulate and defeat her.','https://image.tmdb.org/t/p/w500/yjnwhO3Lz7BkWRltlRzTVgCTKGW.jpg','2019-06-04',5.5,0),(22152,'The Anthrax Attacks: In the Shadow of 9/11','en','Days after 9/11, letters containing fatal anthrax spores spark panic and tragedy in the US. This documentary follows the subsequent FBI investigation.','https://image.tmdb.org/t/p/w500/bTJvGRD7AKaEMUOahCDfvq5rwx5.jpg','2022-09-08',6.9,0),(22153,'Barbie: Star Light Adventure','en','Barbie is a cosmic princess who flies high on her hoverboard through a far-off universe with her adorable and devoted pet sidekick, Pupcorn. One day, everything changes when the twinkling stars start to dim and slow their dance in the sky. Barbie travels to a beautiful new planet to join a special rescue team on a mission to save the stars. Once there, she teams up with a group of talented new friends who work together to save the galaxy through exciting hoverboarding adventures. Barbie soon discovers that if she listens to her heart, and with the help of her friends, she might be the leader the whole universe has been waiting for!','https://image.tmdb.org/t/p/w500/9Yq33EXs9YpgrwGXJlJL73OTpt1.jpg','2016-08-12',7,0),(22154,'House of Flying Daggers','zh','In 9th century China, a corrupt government wages war against a rebel army called the Flying Daggers. A romantic warrior breaks a beautiful rebel out of prison to help her rejoin her fellows, but things are not what they seem.','https://image.tmdb.org/t/p/w500/lMwVwfPTVbpMScANktbD7NmMFCi.jpg','2004-05-19',7.3,0),(22155,'Explorer: The Deepest Cave','en','Follows renowned cave explorer Bill Stone as he and his team push the boundaries of what has ever been done before as they attempt one of the greatest achievements of modern exploration — to set a new world record by venturing into the bottom of what is thought to be the deepest cave in the world.','https://image.tmdb.org/t/p/w500/8b20mh53srwGzvkufk59dcWO4OG.jpg','2022-05-30',4.7,0),(22156,'The Legend of the Chupacabras','es','Leo San Juan and his team of \"ghostbusters\" continue with their adventures, this time fighting against the mexican monster himself: \"El Chupacabras\".','https://image.tmdb.org/t/p/w500/137StSquVSbMhLUB55kmRhMC8t8.jpg','2016-10-21',7.2,0),(22157,'Cashback','en','After a painful breakup, Ben develops insomnia. To kill time, he starts working the late night shift at the local supermarket, where his artistic imagination runs wild.','https://image.tmdb.org/t/p/w500/f77hydXxqGirGEvJdWpETfMdAg2.jpg','2006-05-09',7,0),(22158,'Barry Lyndon','en','An Irish rogue uses his cunning and wit to work his way up the social classes of 18th century England, transforming himself from the humble Redmond Barry into the noble Barry Lyndon.','https://image.tmdb.org/t/p/w500/A0byHUHMwZ7dtBQtfZ44QIgDbjo.jpg','1975-11-26',8,0),(22159,'Scooby-Doo! & Batman: The Brave and the Bold','en','Scooby-Doo and the Mystery Inc. gang meet up with Batman and other friends to defeat evil villains and save the day.','https://image.tmdb.org/t/p/w500/hSPeF1zoYH8kCOhFMu7x3B55zu6.jpg','2018-01-31',7.4,0),(22160,'Eagle Eye','en','Jerry Shaw and Rachel Holloman are two strangers whose lives are suddenly thrown into turmoil by a mysterious woman they have never met. Threatening their lives and family, the unseen caller uses everyday technology to control their actions and push them into increasing danger. As events escalate, Jerry and Rachel become the country\'s most-wanted fugitives and must figure out what is happening to them.','https://image.tmdb.org/t/p/w500/9KCOv0hL37IN3tWG3j86eZg3xDH.jpg','2008-09-25',6.4,0),(22161,'Tom and Jerry: The Magic Ring','en','Tom is left in charge of a priceless magical ring by his young wizard master. He is then horrified when the ring gets stuck on Jerry\'s head, who then runs off into the city.','https://image.tmdb.org/t/p/w500/fF6I48WGKktHfGYYSVKPTVildWE.jpg','2001-11-12',6.3,0),(22162,'Ooops! Noah Is Gone...','en','It\'s the end of the world. A flood is coming. Luckily for Dave and his son Finny, a couple of clumsy Nestrians, an Ark has been built to save all animals. But as it turns out, Nestrians aren\'t allowed. Sneaking on board with the involuntary help of Hazel and her daughter Leah, two Grymps, they think they\'re safe. Until the curious kids fall off the Ark. Now Finny and Leah struggle to survive the flood and hungry predators and attempt to reach the top of a mountain