s','zh','Dee, the detective serving Chinese empress Wu Zetian, is called upon to investigate a series of strange events in Loyang, including the appearance of mysterious warriors wearing Chiyou ghost masks, foxes that speak human language and the pillar sculptures in the palace coming alive.','https://image.tmdb.org/t/p/w500/nZ3XTA5ZlGOj92jRBSYglW8r9QY.jpg','2018-07-27',6.3,0),(22169,'The Clovehitch Killer','en','A picture-perfect family is torn apart after Tyler finds a cache of disturbing images in his father\'s possession. He begins to suspect that the man he trusts most in the world may be responsible for the murder of 13 women ten years prior.','https://image.tmdb.org/t/p/w500/6NmsbUJqnopbnLun2E4KvtVNj8T.jpg','2018-11-16',6.4,0),(22170,'The Aeronauts','en','In 1862, daredevil balloon pilot Amelia Wren teams up with pioneering meteorologist James Glaisher to advance human knowledge of the weather and fly higher than anyone in history. While breaking records and advancing scientific discovery, their voyage to the very edge of existence helps the unlikely pair find their place in the world they have left far below them. But they face physical and emotional challenges in the thin air, as the ascent becomes a fight for survival.','https://image.tmdb.org/t/p/w500/kZHnblqmTBUBgzYBIxWIz9txsEi.jpg','2019-11-04',6.8,0),(22171,'Unish 20','bn','Film data is unknown at this point','https://image.tmdb.org/t/p/w500/pbQfRkn1I1zT0dm1HC6xGv6BYFU.jpg','2023-02-13',0,0),(22172,'Belzebuth','es','While leading a police investigation of a massacre in a public school at the border of Mexico and U.S.A, special Agent Emanuel Ritter links this strange case to the coming and rising of the ancient demon Belzebuth. But in order to stop the trail of upcoming infanticides, Ritter shall have to confront himself before dealing with the forces of good and evil.','https://image.tmdb.org/t/p/w500/em79Vu871uUVZEpBY6qkO5O6psP.jpg','2019-01-11',7.2,0),(22173,'To Wong Foo, Thanks for Everything! Julie