uring a 36-hour period.','https://image.tmdb.org/t/p/w500/86BdPC6RDX88NC880pLidKn2LCj.jpg','2005-05-06',7.2,0),(22183,'King Kong Lives','en','After falling from the Twin Towers, Kong lies in a coma for ten years. When his heart begins to fail, scientists engineer an artificial heart, and a giant female ape is captured to serve as a source for a blood transfusion. When Kong awakens following his heart transplant, he senses the nearby presence of the female ape and the two escape to wreak havoc together.','https://image.tmdb.org/t/p/w500/gI37vg2otF348OHxsx97hWCVvNI.jpg','1986-12-19',5.2,0),(22184,'Senseless','en','A student gets his senses enhanced by an experimental drug. But abuse is not an option.','https://image.tmdb.org/t/p/w500/rqy7OFHWy1NMjmgjyI8XYcl0VU5.jpg','1998-02-20',6.1,0),(22185,'Stuber','en','After crashing his car, a cop who\'s recovering from eye surgery recruits an Uber driver to help him catch a heroin dealer. The mismatched pair soon find themselves in for a wild day of stakeouts and shootouts as they encounter the city\'s seedy side.','https://image.tmdb.org/t/p/w500/gqk7ndiGn9WUT5UDTm6KHwGTv3m.jpg','2019-07-11',6.7,0),(22186,'Stuck in Love','en','An acclaimed writer, his ex-wife, and their teenaged children come to terms with the complexities of love in all its forms over the course of one tumultuous year.','https://image.tmdb.org/t/p/w500/qw34d1M7GtE4GPf0eI8QBnUEA0T.jpg','2013-06-14',7.4,0),(22187,'Critters 2','en','A batch of unhatched critter eggs are mistaken for Easter eggs by the country-folk inhabitants of Grover\'s Bend and, before long, the ferocious furballs are on the rampage again.','https://image.tmdb.org/t/p/w500/5rR3dVJXnXskkBBWKbLg5EDKWtT.jpg','1988-04-29',6,0),(22188,'Sniper 2','en','Sergeant Thomas Beckett is back - and this time he has teamed up with death row inmate B.J. Cole on a suicide mission to the Balkans. Their target: a rogue general accused of running ethnic cleansing missions. But when Becket discovers that the government is using him as a pawn in a bigger mission, the body count grows and bullets really start to fly.','https://image.tmdb.org/t/p/w500/dmHfc2h9bpCFOloUj54jntM0c9L.jpg','2002-12-28',5.4,0),(22189,'Family History Mysteries: Buried Past','en','Genealogist Sophie McClaren is an expert at bringing families together. When her close friend Jonathan urgently needs to find a bone marrow donor, the case becomes personal.','https://image.tmdb.org/t/p/w500/tNLKLnpu5byyekxPsV0Lbpr1GTG.jpg','2023-02-05',7,0),(22190,'Scooby-Doo! Abracadabra-Doo','en','The gang goes on a trip to check on Velma\'s younger sister, Madelyn. She\'s been studying stage magic at the Whirlen Merlin Magic Academy, where apparently there have been sightings of a giant griffin. The gang decides to investigate.','https://image.tmdb.org/t/p/w500/4Pld6ahonT4jTem3FhY7hniNjPI.jpg','2010-02-16',7.8,0),(22191,'Bandidas','en','Set in the late 19th century. When a ruthless robber baron takes away everything they cherish, a rough-and-tumble, idealistic peasant and a sophisticated heiress embark on a quest for justice, vengeance…and a few good heists.','https://image.tmdb.org/t/p/w500/3qdc6SohDYb1pe9ypv4NShWZMAN.jpg','2006-01-18',6,0),(22192,'Firebreather','en','It\'s not easy being a teen like Duncan. His mom wants him to pay more attention to his homework, while his dad - a 120-foot-tall monster known as a Kaiju - wants him to become the next King of All Monsters. When these worlds collide, Duncan must use his human wits and his Kaiju powers - including super strength, agility and the ability to breathe fire - to protect his family and friends from a giant monster rampage.','https://image.tmdb.org/t/p/w500/SAVggPzEtiS4zYfq5ELJkrL3s3.jpg','2010-11-24',7.5,0),(22193,'Cool World','en','A bizarre accident lands Frank Harris in Cool World, a realm of cartoons. Years later, cartoonist Jack Deebs, who\'s been drawing Cool World, crosses over as well. He sets his lustful sights on animated femme fatale Holli Would, but she\'s got plans of her own to become real, and it\'s up to Frank to stop her.','https://image.tmdb.org/t/p/w500/mqzRUHNtFwmgJCmSnvq3JnX0xgZ.jpg','1992-07-10',5.6,0),(22194,'Zambezia','en','Set in a bustling bird city on the edge of the majestic Victoria Falls, \"Zambezia\" is the story of Kai - a naïve, but high-spirited young falcon who travels to the bird city of \"Zambezia\" where he discovers the truth about his origins and, in defending the city, learns how to be part of a community.','https://image.tmdb.org/t/p/w500/7aJl440TlbyqthklVrvCnSbjKYe.jpg','2012-06-05',6,0),(22195,'Normal','en','A deadly car accident brings together a group of previously unrelated people, each of whom is forced to deal with the emotional fallout.','https://image.tmdb.org/t/p/w500/i833frx7UyaJCW8y0RK5wj4xBzn.jpg','2007-09-10',5.6,0),(22196,'Highlander: Endgame','en','Immortals Connor and Duncan Macleod join forces against a man from Connor\'s distant past in the highlands of Scotland, Kell, an immensely powerful immortal who leads an army of equally powerful and deadly immortal swordsmen and assassins. No immortal alive has been able to defeat Kell yet, and neither Connor nor Duncan are skilled enough themselves to take him on and live. The two of them eventually come to one inevitable conclusion; one of them must die so that the combined power of both the Highlanders can bring down Kell for good. There can be only one... the question is, who will it be?','https://image.tmdb.org/t/p/w500/pFgdn4kwtgLjd73lXFtif7G2GWs.jpg','2000-09-01',4.9,0),(22197,'The Men Who Stare at Goats','en','A reporter in Iraq might just have the story of a lifetime when he meets Lyn Cassady, a guy who claims to be a former member of the U.S. Army\'s New Earth Army, a unit that employs paranormal powers in their missions.','https://image.tmdb.org/t/p/w500/5boJKypPQmgABssbKOk2RvsCnSv.jpg','2009-10-17',6,0),(22198,'Recess: School\'s Out','en','It\'s the most exciting time of year at Third Street Elementary-- the end of the School Year! But boredom quickly sets in for protagonist TJ Detweiler, as his friends are headed for Summer Camp. One day, while passing by the school on his bike, he notices a green glow coming from the school\'s auditorium. This is the work of the insidious ex-principal of Third Street, Phillium Benedict and his gang of ninjas and secret service look-alikes! Benedict is planning to get rid of Summer Vacation using his newly-acquired Tractor Beam, which he stole from the US Military Base in an effort to raise US Test Scores, and it\'s up to the Recess Gang to stop him!','https://image.tmdb.org/t/p/w500/qsUCoeTwCNIrvDrUiWlTCgyRFZy.jpg','2001-01-27',6.5,0),(22199,'South Park the Streaming Wars Part 2','en','A drought has brought the town of South Park to the brink of disaster.','https://image.tmdb.org/t/p/w500/cqWXH5rYHTD32I5RY6pHR828BrO.jpg','2022-07-13',7.4,0),(22200,'The Last Emperor','en','A dramatic history of Pu Yi, the last of the Emperors of China, from his lofty birth and brief reign in the Forbidden City, the object of worship by half a billion people; through his abdication, his decline and dissolute lifestyle; his exploitation by the invading Japanese, and finally to his obscure existence as just another peasant worker in the People\'s Republic.','https://image.tmdb.org/t/p/w500/7CZSCaGxCD2HXo8LrdcW183moqJ.jpg','1987-10-04',7.6,0),(22201,'The Signal','en','On a road trip, Nic and two friends are drawn to an isolated area by a computer genius. When everything suddenly goes dark, Nic regains consciousness - only to find himself in a waking nightmare.','https://image.tmdb.org/t/p/w500/opZNdMgVBl3kKpKlW58PXnLZKFV.jpg','2014-03-15',6,0),(22202,'Bring It On: Worldwide #Cheersmack','en','When Destiny, captain of three-time national champions \"The Rebels,\" is challenged to a global cheer showdown by an edgy new team called \"The Truth,\" the Cheer Goddess organizes a virtual battle for squads from all around the world. It seems like the whole world wants to take down Destiny and her team, and they just might succeed, unless Destiny can rise to the challenge, set her ego aside and figure out who her real friends are.','https://image.tmdb.org/t/p/w500/jNZnw3TXNFWv7KVhZIDOszZnUH9.jpg','2017-08-29',6.1,0),(22203,'Beverly Hills Chihuahua 2','en','Puppy mayhem turns the lives of newlywed Chihuahua parents Papi and Chloe upside down when their rambunctious, mischievous puppies present one challenge after another. But when their human owners end up in trouble, the tiny pups will stop at nothing to save them - because in good times and hard times, the family always sticks together. So Papi, Chloe and the puppies embark on a heroic adventure, proving once again that big heroes come in small packages.','https://image.tmdb.org/t/p/w500/k3IHj3utp8m0X1KpNHyfOIsypE1.jpg','2011-02-01',5.8,0),(22204,'Harold & Kumar Escape from Guantanamo Bay','en','Having satisfied their urge for White Castle, Harold and Kumar jump on a plane to catch up with Harold\'s love interest, who\'s headed for the Netherlands. But the pair must change their plans when Kumar is accused of being a terrorist. Rob Corddry also stars in this wild comedy sequel that follows the hapless stoners\' misadventures as they try to avoid being captured by the Department of Homeland Security.','https://image.tmdb.org/t/p/w500/pRo2wOKbJEfoLnTK1APcDtKfGzL.jpg','2008-04-25',6.3,0),(22205,'Seeking a Friend for the End of the World','en','As an asteroid nears Earth, a man finds himself alone after his wife leaves in a panic. He decides to take a road trip to reunite with his high school sweetheart. Accompanying him is a neighbor who inadvertently puts a wrench in his plan.','https://image.tmdb.org/t/p/w500/rBbCwFLyt7Q25yaw2bEOQh7RMG1.jpg','2012-06-22',6.5,0),(22206,'Tinker Tailor Soldier Spy','en','In the bleak days of the Cold War, espionage veteran George Smiley is forced from semi-retirement to uncover a Soviet mole within his former colleagues at the heart of MI6.','https