ector of photography Ken Seng, executive producer/unit production manager John J. Kelly, previs supervisor Franck Balson, stunt coordinator Philip J. Silvera, visual effects supervisors Pauline Duvall and Jonathan Rothbart, visual effects producer Annemarie Griggs, 2nd unit director/stunt coordinator Robert Alonzo, special effects coordinator Alex Burdett, utility stunts Regis Harrington, composer Tom Holkenberg, and actors Morena Baccarin, TJ Miller, Brianna Hildebrand, Leslie Uggams, Ed Skrein, and Gina Carano.','https://image.tmdb.org/t/p/w500/tDMiN3NE3w5rLLafv5zjuDg8Jod.jpg','2016-05-10',2,0),(22244,'Pilgrimage','en','In 13th century Ireland a group of monks must escort a sacred relic across a landscape fraught with peril.','https://image.tmdb.org/t/p/w500/lR5ilnIzIonItxL5mQPAPzXpwPJ.jpg','2017-04-23',5.9,0),(22245,'The Cell','en','A psychotherapist journeys inside a comatose serial killer in the hopes of saving his latest victim.','https://image.tmdb.org/t/p/w500/58U0jRJmX8K62Zh1QcYVwQDoDtE.jpg','2000-08-17',6.3,0),(22246,'Magnum Force','en','\"Dirty\" Harry Callahan is a San Francisco Police Inspector on the trail of a group of rogue cops who have taken justice into their own hands. When shady characters are murdered one after another in grisly fashion, only Dirty Harry can stop them.','https://image.tmdb.org/t/p/w500/dzKHEkbLf8JXKI1HkcW0deT8bvO.jpg','1973-12-23',7.1,0),(22247,'The Monster','en','A mother and her 10-year old daughter are trapped in a forest. There is something in this forest. Something unlike anything they have heard before. Something that lurks in the darkness and it’s coming after them.','https://image.tmdb.org/t/p/w500/hfZlhea7wCNQK78VfZC3gDJ4si.jpg','2016-11-11',5.5,0),(22248,'The Stepford Wives','en','What does it take to become a Stepford wife, a woman perfect beyond belief? Ask the Stepford husbands, who\'ve created this high-tech, terrifying little town.','https://image.tmdb.org/t/p/w500/ygr0Wlmm1KmE16TUefNitIscVBG.jpg','2004-06-10',5.