ndoned by their selfish parents, they must learn how to adapt their Old-Fashioned values to the contemporary world in order to create something new: The Modern Family.','https://image.tmdb.org/t/p/w500/9WrMmjdZvpxLQh1tCQ9tOd1asOb.jpg','2020-04-22',7.1,0),(22262,'The Prince & Me 2: The Royal Wedding','en','With just weeks before their royal wedding, Paige and Edvard find their relationship and the Danish monarchy in jeopardy when an old law is brought to light, stating that an unmarried heir to the throne may marry only a woman of noble blood or else he must relinquish his crown.','https://image.tmdb.org/t/p/w500/grw6Z9fGAk8RpPjXWYxKPCyDInd.jpg','2006-02-21',5.7,0),(22263,'Collide','en','An American backpacker gets involved with a ring of drug smugglers as their driver, and winds up on the run from his employers across Cologne’s autobahns.','https://image.tmdb.org/t/p/w500/mmRizqT81KfcY91hndIt0TReqtB.jpg','2016-06-10',5.5,0),(22264,'My Bloody Valentine','en','Ten years ago, a tragedy changed the town of Harmony forever. Tom Hanniger, an inexperienced coal miner, caused an accident in the tunnels that trapped and killed five men and sent the only survivor, Harry Warden, into a permanent coma. But Harry Warden wanted revenge. Exactly one year later, on Valentine’s Day, he woke up…and brutally murdered twenty-two people with a pickaxe before being killed.','https://image.tmdb.org/t/p/w500/9biIVOMTdvv4aj4a5HClmrK5EHB.jpg','2009-01-16',5.5,0),(22265,'The Postcard Killings','en','After suffering a personal tragedy, and desperate for justice, Jacob Kanon, a veteran New York City police detective, embarks on the search for a twisted killer who is leaving a bloody trail of elaborate murders across Europe.','https://image.tmdb.org/t/p/w500/ugLLTEYBuNTqdQ0zCjFCJ5mI44p.jpg','2020-03-13',6.5,0),(22266,'Mike\'s New Car','en','Mike discovers that being the top-ranking laugh collector at Monsters, Inc. has its benefits – in particular, earning enough money to buy a six-wheel-drive car that\'s loaded with gadgets. That new-car smell doesn\'t last long enough, however, as Sulley jump-starts an ill-fated road test that teaches Mike the true meaning of buyer\'s remorse.','https://image.tmdb.org/t/p/w500/npZIG1O3qqQ1TukLXPnx774zBfX.jpg','2002-05-24',6.9,0),(22267,'Un like de Navidad','es','Catalina is an influencer that stopped believing in Santa Claus and decides to ruin her siblings Christmas.','https://image.tmdb.org/t/p/w500/ev7CmqPpqgQiBwaEhxq8ZC83AAj.jpg','2022-11-24',5,0),(22268,'Monster High: Haunted','en','Lurk what\'s waiting for the Monster High ghouls when they bring their killer fashion to the howlways of the spooktacular Haunted High! When the ghouls of Monster High follow Spectra Vondergeist one day, they discover a creeperiffic Ghost World with an all-spirit school. But their scary-cute student bodies are hardly welcome with the very strict Principal Revenant, and she punishes Spectra with frightful detention chains that prevent her from re-joining Monster High. Now, it\'s up to the imperfectly perfect friends to take on ghostly forms in order to save one of their own from disappearing forever!','https://image.tmdb.org/t/p/w500/jvwpfW0xRt2pQGD5tJbqmkc9STb.jpg','2015-03-02',7.4,0),(22269,'Demon Slayer','en','Five delinquent teenagers are assigned the task of converting a long-abandoned mental hospital in South Central Los Angeles into a community center. Little do they know that the hospital is the site of centuries of supernatural mayhem and murder. Plagued by terrors beyond belief, the teenagers must fight to survive a battle where the division between the living and the dead is shattered.','https://image.tmdb.org/t/p/w500/wFeHHxnTrSb4NaFRqFDYcqtqbQ1.jpg','2003-02-20',7.8,0),(22270,'Better Watch Out','en','On a quiet suburban street tucked within a \'safe neighborhood\', a babysitter must defend a twelve-year-old boy from strangers breaking into the house, only to discover that this is far from a normal home invasion.','https://ima