 Perret, furious at the loss of income that Tango and Cash have caused him, frames the two for murder. Caught with the murder weapon on the scene of the crime, the two have no alibi. Thrown into prison with most of the criminals they helped convict, it appears that they are going to have to trust each other if they are to clear their names and catch the evil Perret.','https://image.tmdb.org/t/p/w500/bLTBlfV0sJwrwwLJW4JgHwgHrJJ.jpg','1989-12-22',6.4,0),(22277,'El Angel','es','Buenos Aires, Argentina, 1971. Carlos Robledo Puch is a 19-year-old boy with an angelic face, but a vocational thief as well, who acts ruthlessly, without remorse. When he meets Ramón, they follow together a dark path of crime and death.','https://image.tmdb.org/t/p/w500/iYrcnrxv80L9JbV9YfVv45VpNM2.jpg','2018-08-09',7.4,0),(22278,'Next-Door Nightmare','en','When young couple Sarah and Kyle move next door to Helen, a charismatic older woman, they have no idea she\'s a deeply disturbed psychopath who will stop at nothing to become Sarah\'s surrogate mother, and grandmother to the child she is expecting. Julia Borsellino, Mark Taylor, Deborah Grover, Marium Carvell star. (2021)','https://image.tmdb.org/t/p/w500/lkCi5Cm71QqHEwuIppWoI7paiZn.jpg','2021-07-08',5.3,0),(22279,'The Tiger\'s Nest','en','In the valleys of the Himalayas, an orphan boy saves a Bengal tiger cub from the ruthless poachers who killed the tiger\'s mother. Together they set out in the Himalayan mountains to the Taktsang monastery in Bhutan known as \"The Tiger\'s Nest\" where Buddhist monks took refuge after the 1950 Chinese invasion of Tibet and protect the big cats. A new great film for the whole family that talks about the importance of defending animals through the story of the friendship between two orphans, a tiger cub and a child, in a tale of brotherhood and the discovery of life.','https://image.tmdb.org/t/p/w500/kcTVF6AxGhME5auzcbII14U3E9f.jpg','2022-10-13',4.8,0),(22280,'My Friend Dahmer','en','Jeffrey Dahmer struggles 