on plans turn into a most unexpected adventure and heartwarming lesson. After a snowstorm diverts their plane, the girls find themselves far from their New York destination and their holiday dreams. Now stranded at a remote inn in the tiny town of Tannenbaum, the sisters are welcomed by new friends and magical experiences. In appreciation for the wonderful hospitality they receive, they use their musical talents to put on a performance for the whole town. Barbie and her sisters realize the joy of being together is what really makes A Perfect Christmas!','https://image.tmdb.org/t/p/w500/u14NrsyD9h505ZXs5Ofm7Tv3AuM.jpg','2011-11-03',6.7,0),(22291,'Days of Thunder','en','Talented but unproven stock car driver Cole Trickle gets a break and with the guidance of veteran Harry Hogge turns heads on the track. The young hotshot develops a rivalry with a fellow racer that threatens his career when the two smash their cars. But with the help of his doctor, Cole just might overcome his injuries-- and his fear.','https://image.tmdb.org/t/p/w500/4kHzXHRJGcRxxRvkCvb5yTxZwml.jpg','1990-06-27',6.3,0),(22292,'Codename: Kids Next Door - Operation Z.E.R.O.','en','The villains of the Kids Next Door, lead by Father, join forces to resurrect the Ultimate Evil, Grandfather, a tyrant who once ruled the world many years ago when most of the villains were themselves kids. However, Father disgraced him that he can\'t even try to destroy the KND and the Villains were quickly betrayed when they are turned into Senior Citizombies, creatures that are immortal and can transform any living creature into one of them and slaves who are forced to make Tapioca to refuel Grandfather so he can find and destroy the Book of K.N.D.','https://image.tmdb.org/t/p/w500/fwgLVVHcDT2XtR3I9ozHN2CwC0v.jpg','2006-08-10',8.1,0),(22293,'The Time Machine','en','A Victorian Englishman travels to the far future and finds that humanity has divided into two hostile species.','https://image.tmdb.org/t/p/w500/cq2kBK4t0ADB3Nc83