ishes to increase his already considerable power over the king. D\'Artagnan must also juggle affairs with the charming Constance Bonancieux and the passionate Lady De Winter, a secret agent for the cardinal.','https://image.tmdb.org/t/p/w500/6qjW1e31k2XhcWpzGz6lgHcRt5W.jpg','1973-12-11',6.8,0),(22300,'Breaking','en','Desperate for money and running out of options, Marine veteran Brian Brown-Easley holds several people hostage inside a bank, setting the stage for a tense confrontation with police.','https://image.tmdb.org/t/p/w500/rKbgbzJbVM7MLjN7EwdO1QcIXCz.jpg','2022-08-25',6.5,0),(22301,'My Landlord Wants Me Dead','en','A college dropout unwittingly puts her own life at stake when she investigates a series of strange and terrifying events at her aunt\'s secluded ranch house.','https://image.tmdb.org/t/p/w500/lIQKoSGY8sR072NTp012i5tIfUU.jpg','2023-02-05',7,0),(22302,'Judas and the Black Messiah','en','Bill O\'Neal infiltrates the Black Panthers on the orders of FBI Agent Mitchell and J. Edgar Hoover. As Black Panther Chairman Fred Hampton ascends—falling for a fellow revolutionary en route—a battle wages for O’Neal’s soul.','https://image.tmdb.org/t/p/w500/iIgr75GoqFxe1X5Wz9siOODGe9u.jpg','2021-02-12',7.4,0),(22303,'The World\'s Fastest Indian','en','The life story of New Zealander Burt Munro, who spent years building a 1920 Indian motorcycle—a bike which helped him set the land-speed world record at Utah\'s Bonneville Salt Flats in 1967.','https://image.tmdb.org/t/p/w500/4dz05TygW3MaDPtSzJBM19Bugbf.jpg','2005-10-12',7.6,0),(22304,'The Virgin Suicides','en','A group of male friends become obsessed with five mysterious sisters who are sheltered by their strict, religious parents.','https://image.tmdb.org/t/p/w500/wDrTeDUuWf7SRQnkVea2ZpOcwnt.jpg','1999-12-31',7.1,0),(22305,'A Christmas Carol','en','A bitter old miser who makes excuses for his uncaring nature learns real compassion when three ghosts visit him on Christmas Eve.','https://image.tmdb.org/t/p/w500/kGmpIkj