 suspicion of murder by Bill Gillespie, the racist police chief of tiny Sparta, Mississippi. After Tibbs proves not only his own innocence but that of another man, he joins forces with Gillespie to track down the real killer. Their investigation takes them through every social level of the town, with Tibbs making enemies as well as unlikely friends as he hunts for the truth.','https://image.tmdb.org/t/p/w500/fvqHTabYej3LwzKRRZCm6jV3g0O.jpg','1967-08-02',7.7,0),(22313,'Psycho','en','A young female embezzler arrives at the Bates Motel, which has terrible secrets of its own.  Although this version is in color, features a different cast, and is set in 1998, it is closer to a shot-for-shot remake than most remakes, Gus Van Sant often copying Hitchcock\'s camera movements and editing, and Joseph Stefano\'s script is mostly carried over. Bernard Herrmann\'s musical score is reused as well, though with a new arrangement by Danny Elfman and recorded in stereo.','https://image.tmdb.org/t/p/w500/xpLyh5jcjNgUfRy6zeGvAx3Td5B.jpg','1998-12-04',5.1,0),(22314,'The Cabbage Soup','fr','Two buddy farmers are visited by aliens who like their domestic cabbage soup.','https://image.tmdb.org/t/p/w500/zEUG0uqQBAQ9fYV8eL2S2twYAhf.jpg','1981-12-02',6.4,0),(22315,'Dead Snow 2: Red vs. Dead','no','The gruesome Nazi Zombies are back to finish their mission, but our hero is not willing to die. He is gathering his own army to give them a final fight.','https://image.tmdb.org/t/p/w500/bllzic3ydohA9i1fL3bCiRZMVK9.jpg','2014-02-12',6.6,0),(22316,'Second Act','en','Maya, a 40-year-old woman struggling with frustrations from unfulfilled dreams. Until that is, she gets the chance to prove to Madison Avenue that street smarts are as valuable as book smarts, and that it is never too late for a second act.','https://image.tmdb.org/t/p/w500/maUMIZVGs8g1hYtq4dQ9Lg9FtVF.jpg','2018-11-22',6.4,0),(22317,'Wall Street: Money Never Sleeps','en','As the global economy teeters on the brink of disaster, a young Wall Street trader partners with disgraced former Wall Street corporate raider Gordon Gekko on a two tiered mission: To alert the financial community to the coming doom, and to find out who was responsible for the death of the young trader\'s mentor.','https://image.tmdb.org/t/p/w500/i9DFTWbD6mpM6UT3HlzZwlA92l4.jpg','2010-09-02',6.1,0),(22318,'Directing Annabelle: Creation','en','Director David F. Sandberg takes you through the process behind making the 2017 horror film Annabelle Creation.','https://image.tmdb.org/t/p/w500/rpAUIFPevxQkdqiSxGzVbXSo5N6.jpg','2017-08-07',9.3,0),(22319,'The Superdeep','ru','In 1984, a Russian research team goes below the surface to find out what secret the world\'s deepest borehole is hiding. On their expedition, something unexpectedly gruesome awaits the researchers.','https://image.tmdb.org/t/p/w500/qjUzknf87fLILSCfVf28xcqrJJN.jpg','2020-11-04',6.2,0),(22320,'Bad Moms','en','When three overworked and under-appreciated moms are pushed beyond their limits, they ditch their conventional responsibilities for a jolt of long overdue freedom, fun, and comedic self-indulgence.','https://image.tmdb.org/t/p/w500/9PaIkUnfOcU1wi5cFbamnmAkjEs.jpg','2016-07-28',6.5,0),(22321,'The Wild Thornberrys Movie','en','Eliza and Debbie are two sisters who don\'t always get along. But their relationship is put to the test when Debbie\'s life is in danger, and Eliza might have to give up her power to talk to animals....','https://image.tmdb.org/t/p/w500/nmWpcUQtWHC4kjVCygiFEDR1wCY.jpg','2002-12-20',6.5,0),(22322,'Beavis and Butt-Head Do America','en','Mike Judge\'s slacker duo, Beavis and Butt-Head, wake to discover their TV has been stolen. Their search for a new one takes them on a clueless adventure across America where they manage to accidentally become America\'s most wanted.','https://image.tmdb.org/t/p/w500/wEB1GPT7mQcTNuYT73s72ljjbMF.jpg','1996-12-15',6.6,0),(22323,'Ivanhoe','en','Sir Walter Scott\'s classic story of the chivalrous Ivanhoe who joins with Robin of Locksley in the fight against Prince John and for the return of King Richard the Lionheart.','https://image.tmdb.org/t/p/w500/vQAs9zc5tMOSg2wNPHAVPkx51B7.jpg','1952-07-31',6.9,0),(22324,'The Tigger Movie','en','Winnie the Pooh, Piglet, Owl, Kanga, Roo, and Rabbit are preparing a suitable winter home for Eeyore, the perennially dejected donkey, but Tigger\'s continual bouncing interrupts their efforts. Rabbit suggests that Tigger go find others of his kind to bounce with, but Tigger thinks \"the most wonderful thing about tiggers is\" he\'s \"the only one!\" Just in case though, the joyously jouncy feline sets out to see if he can find relatives.','https://image.tmdb.org/t/p/w500/lxuiGvLHIL1ZyePP7bn6FcKj0Mr.jpg','2000-02-11',6.5,0),(22325,'Babylon A.D.','en','A veteran-turned-mercenary is hired to take a young woman with a secret from post-apocalyptic Eastern Europe to New York City.','https://image.tmdb.org/t/p/w500/kt9nqD0uOar8IVE9191HXhWOXKI.jpg','2008-08-20',5.6,0),(22326,'Angela\'s Christmas Wish','en','A determined Angela makes a wish to reunite her family in time for Christmas, then launches a plan to find her way from Ireland to Australia.','https://image.tmdb.org/t/p/w500/8ftutOnMM5JHl69mvkNbs8f1AUR.jpg','2020-12-01',6.4,0),(22327,'Star Trek: First Contact','en','The Borg, a relentless race of cyborgs, are on a direct course for Earth. Violating orders to stay away from the battle, Captain Picard and the crew of the newly-commissioned USS Enterprise E pursue the Borg back in time to prevent the invaders from changing Federation history and assimilating the galaxy.','https://image.tmdb.org/t/p/w500/vrC1lkTktFQ4AqBfqf4PXoDDLcw.jpg','1996-11-22',7.3,0),(22328,'Skin Trade','en','After his family is killed by a Serbian gangster with international interests. NYC detective Nick goes to S.E. Asia and teams up with a Thai detective to get revenge and destroy the syndicates human trafficking network.','https://image.tmdb.org/t/p/w500/dfXB4ZKQRINdrY3xXMyLUJrXQai.jpg','2014-11-07',6.2,0),(22329,'Dead Calm','en','An Australian couple take a sailing trip in the Pacific to forget about a terrible accident. While on the open sea, in dead calm weather conditions, they come across a ship with one survivor who is not at all what he seems.','https://image.tmdb.org/t/p/w500/hXpav86ZX5N1YIfVfVtzuZLNrjW.jpg','1989-04-07',6.6,0),(22330,'Blades of Glory','en','When a much-publicized ice-skating scandal strips them of their gold medals, two world-class athletes skirt their way back onto the ice via a loophole that allows them to compete together as a pairs team.','https://image.tmdb.org/t/p/w500/yclY3zyzrL1MS9b6Eygs9ks0ZTY.jpg','2007-03-30',6.1,0),(22331,'Scandalous Sex','en','A daughter seeks to restore the reputation of her disgraced father, a wronged college professor. With help of a professional student, she must overcome an ambitious sorority bitch and corrupt college dean.','https://image.tmdb.org/t/p/w500/l2UWZATSJRwwwx6XUBHQ6jSt4Ka.jpg','2004-01-01',7.1,0),(22332,'Dancing on Glass','es','When immense pressure threatens a ballerina in a new lead role, she and another dancer escape into a friendship that isolates them from the real world.','https://image.tmdb.org/t/p/w500/ppF495JNP6poCCEAm4xM1nJEZzD.jpg','2022-04-08',6.2,0),(22333,'Muppets Most Wanted','en','While on a grand world tour, The Muppets find themselves wrapped into an European jewel-heist caper headed by a Kermit the Frog look-alike and his dastardly sidekick.','https://image.tmdb.org/t/p/w500/3NaHGIsgyIIbf9EuediU75QnJye.jpg','2014-03-20',6.3,0),(22334,'Mune: Guardian of the Moon','fr','When a faun named Mune becomes the Guardian of the Moon, little did he had unprepared experience with the Moon and an accident that could put both the Moon and the Sun in danger, including a corrupt titan named Necross who wants the Sun for himself and placing the balance of night and day in great peril. Now with the help of a wax-child named Glim and the warrior, Sohone who also became the Sun Guardian, they go out on an exciting journey to get the Sun back and restore the Moon to their rightful place in the sky.','https://image.tmdb.org/t/p/w500/4vzqow7mVUahqA4hHoe2UpQOxy.jpg','2015-02-05',7.3,0),(22335,'Starship Troopers 3: Marauder','en','The war against the Bugs continues! A Federation Starship crash-lands on the distant Alien planet OM-1, stranding beloved leader Sky Marshal Anoke and several others, including comely but tough pilot Lola Beck. It\'s up to Colonel/General Johnny Rico, reluctant hero of the original Bug Invasion on Planet P, to lead a team of Troopers on a daring rescue mission.','https://image.tmdb.org/t/p/w500/vh5nospDpMOxZhyhRiXWWMmSFQe.jpg','2008-07-19',4.8,0),(22336,'The Woman in Black','en','The story follows a young lawyer, Arthur Kipps, who is ordered to travel to a remote village and sort out a recently deceased client’s papers. As he works alone in the client’s isolated house, Kipps begins to uncover tragic secrets, his unease growing when he glimpses a mysterious woman dressed only in black. Receiving only silence from the locals, Kipps is forced to uncover the true identity of the Woman in Black on his own, leading to a desperate race against time when he discovers her true identity.','https://image.tmdb.org/t/p/w500/aJbeDPUwDe9MLpseTFrNTBaQPzf.jpg','2012-02-03',6.1,0),(22337,'Buffy the Vampire Slayer','en','Blonde, bouncy Buffy is your typical high school cheerleader. But all that changes when a strange man informs her she\'s been chosen by fate to kill vampires.','https://image.tmdb.org/t/p/w500/2uaFS4bkWqX4jaAP8IXH46p8K3A.jpg','1992-07-24',5.6,0),(22338,'The 6th Day','en','A world of the very near future in which cattle, fish, and even the family pet can be cloned. But cloning humans is illegal - that is until family man Adam Gibson (Arnold Schwarzenegger) comes home from work one day to find a clone has replaced him. Taken from his family and plunged into a sinister world he doesn\'t understand, Gibson must not only save himself from the assassins who must destroy him to protect their secret, but uncover who and what is behind the horrible things happening to him.','https://image.tmdb.org/t/p/w500/oKtQLgBXiC0UOT8d33yJMYYm34Z.jpg','2000-11-17',5.9,0),(22339,'The Boy Next Door','en','A recently cheated on married woman falls for a younger man who has moved in next door, but their torrid affair soon takes a dangerous turn.','https://image.tmdb.org/t/p/w500/tM0hpWw3GONam6TKcMMciecHjhT.jpg','2015-01-23',4.8,0),(22340,'Scooby-Doo! Stage Fright','en','Join Scooby-Doo, Shaggy and the Mystery Inc. crew as they head to Chicago for Talent Star, a hit talent show in which Fred and Daphne are finalists with some high hopes. Unlucky for them, the competition is frightful as the show is being broadcast from an opera house with a history of horrors and a particularly vengeful phantom that has cursed the show\'s production.','https://image.tmdb.org/t/p/w500/vpExEfmhs317qbAGrGvOTi3pxnH.jpg','2013-08-20',7.8,0),(22341,'The Last Letter from Your Lover','en','A young journalist in London becomes obsessed with a series of letters she discovers that recounts an intense star-crossed love affair from the 1960s.','https://image.tmdb.org/t/p/w500/fDKK51YdOfu9pTmSRw7sHUhGFxm.jpg','2021-07-23',7.5,0),(22342,'Glory','en','Robert Gould Shaw leads the US Civil War\'s first all-black volunteer company, fighting prejudices of both his own Union army and the Confederates.','https://image.tmdb.org/t/p/w500/tubPIJJah9iJ9eDHXxaxjLdOcQd.jpg','1989-12-15',7.5,0),(22343,'Radius','en','Liam wakes from a car crash with no memory of who he is. As he makes his way into town to look for help, he finds only dead bodies, all with strange pale eyes. Liam\'s first assessment is that a virus is present in the air, but he soon discovers the horrible truth: anyone who comes within a 50-foot radius of him dies instantly.','https://image.tmdb.org/t/p/w500/3BHYW2Wlcu9ES41Y4OTeSgkhYkD.jpg','2017-07-17',6.6,0),(22344,'Toc Toc','es','Toc Toc follows the adventures and misadventures of a group of patients with OCD dated at the same time.','https://image.tmdb.org/t/p/w500/qKrYZOXuayCcqJri6vwfzA8kCxu.jpg','2017-09-01',7.1,0),(22345,'Dead Again in Tombstone','en','The devil’s outlaw and reluctant servant, Guerrero returns from the dead again in this action-packed western which promises to be one hell of a ride. Guerrero is forced to protect a stolen relic from getting into the hands of Jackson Boomer and his gang of soldiers, but Jackson will stop at nothing to raise his comrades from the dead and bring the wrath of hell upon earth. Guerrero must use all his dark powers in order to defeat Jackson and find redemption…or die again trying.','https://image.tmdb.org/t/p/w500/7dnmxPLiSOOFGZ8llpppMBf6osh.jpg','2017-08-30',5,0),(22346,'Be Mine','en','The VR experience follows Becca, a college senior who\'s going to throw the best Valentine\'s Day party ever. There\'s just one caveat: everyone invited is secretly there to help Becca catch her Valentine\'s Day stalker — an anonymous maniac in a Cupid mask who kills any man that gets close to her with a bow and arrow. But this Valentine\'s Day will be slightly different as everyone is ready to turn the tables on the killer that walks among them. With the help of the police, her sorority sisters and the fraternity next door, Becca and the party fight back to stop the carnage and uncover the mysterious secret behind a bloody Valentine\'s Day massacre.\"','https://image.tmdb.org/t/p/w500/uCQWVy7Buh43ufS3VZuAX0JlkJz.jpg','2023-02-10',6,0),(22347,'Around the World in Eighty Days','en','Based on the famous book by Jules Verne the movie follows Phileas Fogg on his journey around the world. Which has to be completed within 80 days, a very short period for those days.','https://image.tmdb.org/t/p/w500/kk6Rrwh0toMz9tjuUHdS4O3v2Rk.jpg','1956-10-17',6.7,0),(22348,'Julia','de','A young woman discovers that there\'s more to do than ski when in the Swiss Alps.','https://image.tmdb.org/t/p/w500/juyoOQttuYsmlk5n1j3j6JdiGSR.jpg','1974-09-13',4.7,0),(22349,'When a Stranger Calls','en','Far away from the site of a gruesome murder, a teenager named Jill Johnson arrives at a luxurious home for a baby-sitting job. With the children fast asleep, she settles in for what she expects to be an ordinary evening. Soon, the ringing of a phone and the frightening words of a sadistic caller turn Jill\'s routine experience into a night of terror.','https://image.tmdb.org/t/p/w500/h0ZmU7BZDWBucq1FvblfeAWUkad.jpg','2006-02-03',5.7,0),(22350,'The Jungle Book','en','Raised by wild animals since childhood, Mowgli is drawn away from the jungle by the beautiful Kitty. But Mowgli must eventually face corrupt Capt. Boone, who wants both Kitty\'s hand and the treasures of Monkey City – a place only Mowgli can find.','https://image.tmdb.org/t/p/w500/rYoE6cuup9Ofam6AuYaiJLxF9OO.jpg','1994-12-23',6,0),(22351,'The Legend of 1900','it','The story of a virtuoso piano player who lives his entire life aboard an ocean liner. Born and raised on the ship, 1900 (Tim Roth) learned about the outside world through interactions with passengers, never setting foot on land, even for the love of his life. Years later, the ship may be destroyed, and a former band member fears that 1900 may still be aboard, willing to go down with the ship.','https://image.tmdb.org/t/p/w500/iOcbJ5pxokOPDRgieVDbsFMrCc6.jpg','1998-10-28',8.3,0),(22352,'Mirror Mirror','en','After she spends all her money, an evil enchantress queen schemes to marry a handsome, wealthy prince. There\'s just one problem - he\'s in love with a beautiful princess, Snow White. Now, joined by seven rebellious dwarves, Snow White launches an epic battle of good vs. evil...','https://image.tmdb.org/t/p/w500/pys6zIJN8Sxlk2Ss2GZuYuXPbtw.jpg','2012-03-15',5.9,0),(22353,'The Adventurer: The Curse of the Midas Box','en','Seventeen-year-old Mariah Mundi\'s life is turned upside down when his parents vanish and his younger brother is kidnapped. Following a trail of clues to the darkly majestic Prince Regent Hotel, Mariah discovers a hidden realm of child-stealing monsters, deadly secrets and a long-lost artefact that grants limitless wealth—but also devastating supernatural power. With the fate of his world, and his family at stake, Mariah will risk everything to unravel the Curse of the Midas Box.','https://image.tmdb.org/t/p/w500/31ykUoOS2RNdARk3B8z3y25gD8b.jpg','2013-12-05',5.7,0),(22354,'Flesh and Fire','fr','American Raphael talks his colleague at the Parisian University into spending his summer at the family\'s country mansion. But once there Raphael seduces and plays the sisters and mother against each other - until everyone is revealed at their very worst. As it turns out - that was Raphael\'s intention all along - because his own torrid past is deeply rooted in their family\'s dirty history.','https://image.tmdb.org/t/p/w500/hos6hqRDzc6yf036UPhLs0uvoOz.jpg','1985-07-17',4,0),(22355,'Now & Later','en','Sex, politics and American culture are mixed into a combustible combination in Now & Later. Angela is an illegal Latina immigrant living in Los Angeles who stumbles across Bill, a disgraced banker on the run. She takes him in. Through passionate sex, soul-searching conversations ranging from politics to philosophy, and other worldly pleasures, Angela introduces Bill to another worldview. As their affair heats up, the course of Bill\'s life begins to take an abrupt and unexpected turn.','https://image.tmdb.org/t/p/w500/8kVBr6XJglohrIwoqrUNKBvyTC5.jpg','2009-02-18',5.1,0),(22356,'Impossible Things','es','Matilde is a woman who, after the death of her husband - a man who constantly abused her - finds her new best friend in Miguel, her young, insecure, disoriented and even dealer neighbor','https://image.tmdb.org/t/p/w500/t2Ew8NZ8Ci2kqmoecZUNQUFDJnQ.jpg','2021-06-17',8.4,0),(22357,'BlacKkKlansman','en','Colorado Springs, late 1970s. Ron Stallworth, an African American police officer, and Flip Zimmerman, his Jewish colleague, run an undercover operation to infiltrate the Ku Klux Klan.','https://image.tmdb.org/t/p/w500/8jxqAvSDoneSKRczaK8v9X5gqBp.jpg','2018-08-09',7.5,0),(22358,'Sorry if I Love You','it','Alex Belli is a 37 year old advertising executive whose fiancée Elena has just left him, and who is having difficulty at work trying to think of a good advertising campaign for a new Japanese product. Niki is a bubbly 17 year old student. She has three best friends with whom she shares all her problems, and an annoying ex-boyfriend Fabio who is set on getting her back, but Niki\'s not interested. One day on his way to work, Alex collides with Niki on a city street. They soon begin a romance, despite their 20-year age gap.','https://image.tmdb.org/t/p/w500/vVWft6OB88dxVWeWbBjuGL4pzTy.jpg','2008-01-25',5.9,0),(22359,'Music and Lyrics','en','A washed-up \'80s pop star gets a chance at a comeback when reigning pop diva Cora Corman invites him to write & record a duet with her, but there\'s a problem--Alex hasn\'t written a song in years; he\'s never written lyrics and he has to come up with a hit in a matter of days.','https://image.tmdb.org/t/p/w500/xcdA2WLBNcPXMQB9uA5DqqQvbwe.jpg','2007-02-09',6.4,0),(22360,'Ray Donovan: The Movie','en','A showdown decades in the making brings the Donovan family legacy full circle. As the events that made Ray who he is today finally come to light, the Donovans find themselves drawn back to Boston to face the past. Each of them struggles to overcome their violent upbringing, but destiny dies hard, and only their fierce love for each other keeps them in the fight.','https://image.tmdb.org/t/p/w500/5sw1EvOeXMGRZGWr18R4EiZs036.jpg','2022-01-14',6.8,0),(22361,'Rise of the Legend','zh','In 1868 during the late Qing Dynasty, rampant corruption on the Imperial Court inflicts much suffering in people\'s lives. For years, the Black Tiger’s fearsome boss Lei Gong has been trying to get rid of the leader of the Northern Sea. One of his latest recruits is Fei, a fearless fighter who takes the Northern Sea leader’s head after a fierce fight. Just as Lei Gong believes he has total control of the port, a new gang called the Orphans rises in power. Led by Fei’s childhood friend Huo, the Orphans are out to eliminate all the criminal power from the port…','https://image.tmdb.org/t/p/w500/qrxzeV3Z4XmzkgZOdNTtWiYtp0S.jpg','2014-11-20',6.3,0),(22362,'Cape Fear','en','Sam Bowden is a small-town corporate attorney. Max Cady is a tattooed, cigar-smoking, Bible-quoting, psychotic rapist. What do they have in common? 14 years ago, Sam was a public defender assigned to Max Cady\'s rape trial, and he made a serious error: he hid a document from his illiterate client that could have gotten him acquitted. Now, the cagey Cady has been released, and he intends to teach Sam Bowden and his family a thing or two about loss.','https://image.tmdb.org/t/p/w500/ws4mrtndzgSH5QGCamOFAgilr2R.jpg','1991-11-13',7.3,0),(22363,'Racing Stripes','en','Shattered illusions are hard to repair -- especially for a good-hearted zebra named Stripes who\'s spent his life on a Kentucky farm amidst the sorely mistaken notion that he\'s a debonair thoroughbred. Once he faces the fact that his stark stripes mark him as different, he decides he\'ll race anyway. And with help from the young girl who raised him, he just might end up in the winner\'s circle.','https://image.tmdb.org/t/p/w500/epDsuf5oUdzTFYHqV2IRcyy8Rwc.jpg','2005-01-06',5.9,0),(22364,'The Cannonball Run','en','A cross-country road race is based on an actual event, the Cannonball Baker Sea to Shining Sea Memorial Trophy Dash, organized by Brock Yates to protest the 55 mph speed limit then in effect in the U.S. The Cannonball was named for Erwin G. \"Cannonball\" Baker, who in the roaring 20\'s rode his motorcycle across the country. Many of the characters are based on ruses developed by real Cannonball racers over the several years that the event was run.','https://image.tmdb.org/t/p/w500/yDO1xRq4LOAv720xqJHHEVz5Sr9.jpg','1981-06-19',6.2,0),(22365,'Stephanie','en','After a mysterious global crisis, a young girl is left alone to hide from a malevolent power that stalks her home. Her parents eventually return and the struggle begins to save their daughter.','https://image.tmdb.org/t/p/w500/saH984W3ZGjRX0NMCEsuKh8VUP9.jpg','2017-04-27',6.3,0),(22366,'Flash Gordon','en','A football player and his mates travel to the planet Mongo and find themselves fighting the tyranny of Ming the Merciless to save Earth.','https://image.tmdb.org/t/p/w500/5PyiSSJ6lVsY8IbmPHBo1sp596h.jpg','1980-09-01',6.2,0),(22367,'Live and Let Die','en','James Bond must investigate a mysterious murder case of a British agent in New Orleans. Soon he finds himself up against a gangster boss named Mr. Big.','https://image.tmdb.org/t/p/w500/39qkrjqMZs6utwNmihVImC3ghas.jpg','1973-07-05',6.5,0),(22368,'Kung Pow: Enter the Fist','en','A movie within a movie, created to spoof the martial arts genre. Writer/director Steve Oedekerk uses contemporary characters and splices them into a 1970s kung-fu film, weaving the new and old together.  As the main character, The Chosen One, Oedekerk sets off to avenge the deaths of his parents at the hands of kung-fu legend Master Pain. Along the way he encounters some strange characters.','https://image.tmdb.org/t/p/w500/8twRIXhh7EoLZWcihWRKJEgdAXq.jpg','2002-01-25',6.3,0),(22369,'Wonder Woman','en','On the mystical island of Themyscira, a proud and fierce warrior race of Amazons have raised a daughter of untold beauty, grace and strength: Princess Diana. When an Army fighter pilot, Steve Trevor, crash-lands on the island, the rebellious and headstrong Diana defies Amazonian law by accompanying Trevor back to civilization.','https://image.tmdb.org/t/p/w500/zWEMItepejy6FZxemqdchi5dVhs.jpg','2009-03-03',7.2,0),(22370,'Sexy Movie','en','Two down on their luck Hollywood filmmakers decide to make a pornographic film.','https://image.tmdb.org/t/p/w500/o9LjZEBrXl8gBERzaQC7tLjRI7G.jpg','2003-12-03',4.9,0),(22371,'Farewell My Concubine','zh','Abandoned by his prostitute mother in 1920, Douzi was raised by a theater troupe. There he meets Shitou and over the following years the two develop an act entitled \"Farewell My Concubine\" that brings them fame and fortune. When Shitou marries Juxian, Douzi becomes jealous, the beginnings of the acting duo\'s explosive breakup and tragic fall take root.','https://image.tmdb.org/t/p/w500/vHC9dtjOzuwTLP4PIe2X9Dakk60.jpg','1993-01-01',7.9,0),(22372,'Kingpin','en','After bowler Roy Munson swindles the wrong crowd and is left with a hook for a hand, he settles into impoverished obscurity. That is, until he uncovers the next big thing: an Amish kid named Ishmael. So, the corrupt and the hopelessly naive hit the circuit intent on settling an old score with Big Ern.','https://image.tmdb.org/t/p/w500/cT3vdSxcEOTHPf99sbopWt7rdHa.jpg','1996-07-04',6.5,0),(22373,'Gol Maal','hi','A man\'s simple lie to secure his job escalates into more complex lies when his orthodox boss becomes suspicious.','https://image.tmdb.org/t/p/w500/uPW269Qx8VxfiQI2PFHcSJkGOI2.jpg','1979-04-19',7.3,0),(22374,'The Diary of Anne Frank','en','The true, harrowing story of a young Jewish girl who, with her family and their friends, is forced into hiding in an attic in Nazi-occupied Amsterdam.','https://image.tmdb.org/t/p/w500/sQiRryyzOtEkT1zLjc5SXOMQKKT.jpg','1959-03-18',7.2,0),(22375,'Soul Plane','en','Following a ridiculously awful flight that leads to his pet\'s death, Nashawn Wade files a lawsuit against the airline, and wins a multimillion-dollar settlement. Determined to create a better flying experience, Nashawn starts his own airline, one that caters to an African-American clientele. Going into business with a tricked-out plane piloted by the smooth Capt. Mack, the airline hits a snag when it has to deal with the family of Elvis Hunkee.','https://image.tmdb.org/t/p/w500/b5Rzb5JUwPinllWGYUYER3OV14F.jpg','2004-05-28',5.3,0),(22376,'The Ghost and the Darkness','en','Sir Robert Beaumont is behind schedule on a railroad in Africa. Enlisting noted engineer John Henry Patterson to right the ship, Beaumont expects results. Everything seems great until the crew discovers the mutilated corpse of the project\'s foreman, seemingly killed by a lion. After several more attacks, Patterson calls in famed hunter Charles Remington, who has finally met his match in the bloodthirsty lions.','https://image.tmdb.org/t/p/w500/3KEPs6RKlin9pT9fqjtW7MSLC8H.jpg','1996-10-11',6.8,0),(22377,'Ragnarok','no','Archaeologist Sigurd Svendsen discovers that the Oseberg ship hides a secret from the Viking Age. Along with his two children put Sigurd out on a quest to find the truth. The mystery leads them into \"No Man\'s Land\" between Norway and Russia where no man traveling in modern times. Old runes take on new meaning when the secret they uncover is more frightening than anyone could have imagined.','https://image.tmdb.org/t/p/w500/7io1VfX1sRta46vb4aHBnHWgCGp.jpg','2013-01-01',5.7,0),(22378,'The Little Hours','en','Garfagnana, Italy, 1347. The handsome servant Masseto, fleeing from his vindictive master, takes shelter in a nunnery where three young nuns, Sister Alessandra, Sister Ginevra and Sister Fernanda, try unsuccessfully to find out what their purpose in life is, a conundrum that each of them faces in different ways.','https://image.tmdb.org/t/p/w500/wS69OOwBJzimoLIcmYMSVkmhCZM.jpg','2017-06-30',5.8,0),(22379,'Luna','it','While touring in Italy, a recently-widowed American opera singer has an incestuous relationship with her 15-year-old son to help him overcome his heroin addiction.','https://image.tmdb.org/t/p/w500/sNIZAtZbpVHNJRmNBO9rO37t6.jpg','1979-08-29',6.5,0),(22380,'FernGully: The Last Rainforest','en','When a sprite named Crysta shrinks a human boy, Zak, down to her size, he vows to help the magical fairy folk stop a greedy logging company from destroying their home: the pristine rainforest 