 the sale of the family estate. During the visit, a mysterious woman arrives and befriends Vivien, much to Roy’s displeasure. Tensions build and lines are crossed as secrets from Roy’s past force the couple to face aspects of their relationship they did not know existed.','https://image.tmdb.org/t/p/w500/suASijYyJ3jwwEfPki1V3R8vuO9.jpg','2022-10-14',6.3,0),(22387,'Evil - In the Time of Heroes','el','The story begins at the end of the first Kako movie. The survivors meet up with a group of other barricaded survivors and must take care of the zombies as well as other random Greeks that have taken advantage of the chaos, while shooting random moving targets (zombie or not). Throughout we take small flashback visits into ancient Greece where the zombie apocalypse has also happened and we learn how they faced them.','https://image.tmdb.org/t/p/w500/snRJuYZMgG23RPWDiIWSvDg1zHG.jpg','2009-10-01',5.3,0),(22388,'The Danish Girl','en','When Gerda Wegener asks her husband Einar to fill in as a portrait model, Einar discovers the person she\'s meant to be and begins living her life as Lili Elbe. Having realized her true self and with Gerda\'s love and support, Lili embarks on a groundbreaking journey as a transgender pioneer.','https://image.tmdb.org/t/p/w500/mXZZIacI5FC8thzSC0lgQBQ2uAX.jpg','2015-11-27',7.6,0),(22389,'Playmobil: The Movie','en','Marla is forced to abandon her carefully structured life to embark on an epic journey to find her younger brother Charlie who has disappeared into the vast and wondrous animated world of Playmobil toys.','https://image.tmdb.org/t/p/w500/zPQzLZnfVw9fbXyxxglyOsmQBlu.jpg','2019-06-10',5.7,0),(22390,'Project A','cn','In late 19th Century Hong Kong the British may rule the land, but the pirates rule the waters. One Coast Guard officer is Dragon Ma, who is determined that his beloved Coast Guard will not be made a fool of.','https://image.tmdb.org/t/p/w500/1VtV4m9YKrqDHZDlW3bwTenerGS.jpg','1983-12-22',7.2,0),(22391,'The Land Before Time','en','An orphaned brontosaurus named Littlefoot sets off in search of the legendary Great Valley. A land of lush vegetation where the dinosaurs can thrive and live in peace. Along the way he meets four other young dinosaurs, each one a different species, and they encounter several obstacles as they learn to work together in order to survive.','https://image.tmdb.org/t/p/w500/wSC2wxFj3ZgrIHlIaePeuHN4igo.jpg','1988-11-18',7.1,0),(22392,'Monster High: Welcome to Monster High','en','Monsters once lived in hiding—even from each other—because they were afraid they would be in danger if humans knew they existed. But Draculaura, the daughter of Dracula, along with her best ghoulfriends, dreamt of a school where everyone was welcome and accepted for who they are. Determined to make their dream come true, the ghouls travel the world on an epic adventure to recruit new students. But even in this amazing place, there\'s drama: a villainess zombie is spreading trouble rather than friendship, and every student must live with the fear that their secret will be revealed. Now the ghouls must save their school so that every monster has a place where they belong and their uniqueness is celebrated!','https://image.tmdb.org/t/p/w500/ceurB6wkAgMKwR4bVq1PdEJ5bvL.jpg','2016-08-27',6.7,0),(22393,'Lego Scooby-Doo!: Haunted Hollywood','en','The gang find themselves in a tinsel-town twist! While on a VIP tour of the legendary Brickton Studios, Scooby and friends get a first-hand experience of the rumored hauntings when classic movie monsters drop in for a creepy casting call.','https://image.tmdb.org/t/p/w500/y6g6Ojk2SwUkSZSDzmktg7UnEy.jpg','2016-01-28',7.4,0),(22394,'Open 24 Hours','en','After setting her serial killer boyfriend on fire, a paranoid delusional woman gets a job at an all-night gas station. The isolation triggers her anxiety and hallucinations, with devastatingly gory results.','https://image.tmdb.org/t/p/w500/1C97mky8yEy4q7dfcrDzFZoNx8r.jpg','2018-08-27',5.6,0),(22395,'The Kid','en','Powerful businessman Russ Duritz is self-absorbed and immersed in his work. But by the magic of the moon, he meets Rusty, a chubby, charming 8-year-old version of himself who can\'t believe he could turn out so badly – with no life and no dog. With Rusty\'s help, Russ is able to reconcile the person he used to dream of being with the man he\'s actually become.','https://image.tmdb.org/t/p/w500/jNfL8De5IDVIuUYsrNnmPxCQkz8.jpg','2000-07-07',6.5,0),(22396,'A Neighbor\'s Vendetta','en','After her boss-turned-secret lover is found dead, architect Sonja vows to give her marriage another chance. She and her husband decide to make a fresh start and rent a remote cabin. But when an unexpected neighbor appears at their door, they soon discover that she’s linked to Sonja’s adulterous past and is intent on taking “an eye for an eye.”','https://image.tmdb.org/t/p/w500/pXZhSvxXpF9EzJq7vI3081c2wes.jpg','2023-02-10',0,0),(22397,'Bad Samaritan','en','A thief makes a disturbing discovery in the house where he breaks in. Later, when he returns to the same house with his partner in crime, things are no longer how he expected.','https://image.tmdb.org/t/p/w500/ojCu9SLxAPwhhC2tXtHNdrTmxCH.jpg','2018-04-19',6.8,0),(22398,'Svegliami a mezzanotte','it','','https://image.tmdb.org/t/p/w500/d1SVefPZktCMRWAIPXikqiidlPU.jpg','2023-02-13',0,0),(22399,'Megamind: The Button of Doom','en','For their first day on the job as the new protectors of Metro City, Megamind and Minion are selling off the gadgets from their evil lair. But when one seemingly harmless \"button\" unleashes the gigantic robot MEGA-MEGAmind, the duo will have to resort to their old tricks to restore order.','https://image.tmdb.org/t/p/w500/3uKLJ8x5fgggTH4BGGwuUNuf8h0.jpg','2011-02-25',6.7,0),(22400,'Sextuplets','en','Father-to-be Alan is shocked to learn that he was born a sextuplet. With his newfound brother Russell riding shotgun, the duo sets out on a hilarious journey to reunite with their remaining long-lost siblings.','h