rtners with ex-con Dom Toretto on the opposite side of the law. Since Brian and Mia Toretto broke Dom out of custody, they\'ve blown across many borders to elude authorities. Now backed into a corner in Rio de Janeiro, they must pull one last job in order to gain their freedom.','https://image.tmdb.org/t/p/w500/gEfQjjQwY7fh5bI4GlG0RrBu7Pz.jpg','2011-04-20',7.3,0),(22408,'I Still See You','en','A spellbinding and romantic supernatural thriller. Ten years after an apocalyptic event left the world haunted by ghosts, Roni receives a threatening message from beyond the grave. Joining forces with a mysterious classmate, Kirk, Roni descends into a shadow world that blurs the bounds of the living and the dead-and begins a desperate race against time to stop a cunning killer.','https://image.tmdb.org/t/p/w500/9fqzZs922V8OmwgO11Eqclof2mQ.jpg','2018-09-27',6.6,0),(22409,'Green Zone','en','During the U.S.-led occupation of Baghdad in 2003, Chief Warrant Officer Roy Miller and his team of Army inspectors are dispatched to find weapons of mass destruction believed to be stockpiled in the Iraqi desert. Rocketing from one booby-trapped and treacherous site to the next, the men search for deadly chemical agents but stumble instead upon an elaborate cover-up that threatens to invert the purpose of their mission.','https://image.tmdb.org/t/p/w500/czFIaeukSxNEccysQeys1PCkuOG.jpg','2010-03-11',6.5,0),(22410,'The Secret of Kells','en','Adventure awaits 12 year old Brendan who must fight Vikings and a serpent god to find a crystal and complete the legendary Book of Kells. In order to finish Brother Aiden\'s book, Brendan must overcome his deepest fears on a secret quest that will take him beyond the abbey walls and into the enchanted forest where dangerous mythical creatures hide. Will Brendan succeed in his quest?','https://image.tmdb.org/t/p/w500/tmiufIvSssZ2cmYJbro99gZvn2H.jpg','2009-02-09',7.4,0),(22411,'Monsters','en','Six years ago NASA discovered the possibility of alien life within our solar system. A probe was launched to collect samples, but crashed upon re-entry over Central America. Soon after, new life forms began to appear and half of Mexico was quarantined as an infected zone. Today, the American and Mexican military still struggle to contain \"the creatures,\" while a journalist agrees to escort a shaken tourist through the infected zone in Mexico to the safety of the U.S. border.','https://image.tmdb.org/t/p/w500/qpJyTxR33KG9qFmXoCD5AUTToPl.jpg','2010-06-18',6.2,0),(22412,'Sabotage','en','John \"Breacher\" Wharton leads an elite DEA task force that takes on the world\'s deadliest drug cartels. When the team successfully executes a high-stakes raid on a cartel safe house, they think their work is done – until, one-by-one, the team members mysteriously start to be eliminated. As the body count rises, everyone is a suspect.','https://image.tmdb.org/t/p/w500/f5L0WlOAzFiKTOGNZTcKkEJ4iOT.jpg','2014-03-28',5.6,0),(22413,'Two Mules for Sister Sara','en','When a wandering mercenary named Hogan rescues a nun called Sister Sara from the unwanted attentions of a band of rogues on the Mexican plains, he has no idea what he has let himself in for. Their chance encounter results in the blowing up of a train and a French garrison, as well as igniting a spark between them that survives a shocking discovery.','https://image.tmdb.org/t/p/w500/2G9eM8UAM57TanLBhuPmz3jaNZG.jpg','1970-03-02',7,0),(22414,'Age of Tomorrow','en','Mankind must fight to survive as Earth is invaded by hostile UFOs bent on destroying the planet. As the epic battle wages on, astronauts sneak aboard the mothership where they discover a portal to the aliens\' home world. They manage to alert Earth before they are brutally murdered. Left with no other choice, Earth sends an elite military team of science and combat specialists through the portal where they attempt to stop the invasion from the inside out.','https://image.tmdb.org/t/p/w500/rij2GSSXbhNLCFdvJN8YmRRD2i3.jpg','2014-06-10',3,0),(22415,'Chicago','en','Murderesses Velma Kelly and Roxie Hart find themselves on death row together and fight for the fame that will keep them from the gallows in 1920s Chicago.','https://image.tmdb.org/t/p/w500/v1Sg3GuHDz9uhrKqYozOeCMLSpj.jpg','2002-12-10',7.1,0),(22416,'Dancer in the Dark','en','Selma, a Czech immigrant on the verge of blindness, struggles to make ends meet for herself and her son, who has inherited the same genetic disorder and will suffer the same fate without an expensive operation. When life gets too difficult, Selma learns to cope through her love of musicals, escaping life\'s troubles - even if just for a moment - by dreaming up little numbers to the rhythmic beats of her surroundings.','https://image.tmdb.org/t/p/w500/uXvyCRpoTRLSEia59Yj7nAZOSej.jpg','2000-06-30',7.9,0),(22417,'24 Hours to Live','en','An assassin seeks redemption after being given a second chance at life.','https://image.tmdb.org/t/p/w500/w0MXP33x1bq48TDC7IaNqQ8nxcc.jpg','2017-10-26',5.9,0),(22418,'Asterix and the Vikings','fr','Asterix and Obelix have been given a tough mission: Transform the chief\'s lazy nephew Justforkix into a warrior. When the Vikings abduct him and bring him back to their homeland, Asterix and Obelix must travel to Norway to rescue Justforkix.','https://image.tmdb.org/t/p/w500/fer4QcdkxKpVVaZhwKaaS9dmLh9.jpg','2006-04-05',6.1,0),(22419,'The Matrimony','zh','A woman finds the key to a room in the attic that her husband forbids her from entering. When she opens the door, she is confronted with the haunting existence of the woman her husband refuses to forget.','https://image.tmdb.org/t/p/w500/lBKTd8qgvli5Oo3jR8bnTtlu1vK.jpg','2007-02-08',5.9,0),(22420,'Beastly','en','A modern-day take on the \"Beauty and the Beast\" tale where a New York teen is transformed into a hideous monster in order to find true love.','https://image.tmdb.org/t/p/w500/70ApMWwuuR2uD0vLlTq2TxrrOdU.jpg','2011-01-21',6.3,0),(22421,'Chitty Chitty Bang Bang','en','A hapless inventor finally finds success with a flying car, which a dictator from a foreign government sets out to take for himself.','https://image.tmdb.org/t/p/w500/gHET7AjuKU2iX0YsbFTYHKOV3jX.jpg','1968-12-17',6.8,0),(22422,'St. Elmo\'s Fire','en','A group of friends graduate from the halls of Georgetown University into lives that revolve around sex and career aspirations. Kirby waits tables to pay for law school. His roommate Kevin struggles at a D.C. newspaper as he searches for the meaning of love. Jules, an object of adoration and envy, but secretly she has problems of her own. Demure Wendy is in love with Billy—a loveable sax player and an irresponsible drunk. Alec wants it all: a career in politics and the appearance of a traditional home life. Alec’s girlfriend, Leslie, is an ambitious architect who doesn\'t know about his infidelity, but his new allegiance to the Republican Party is already enough to put her off marriage.','https://image.tmdb.org/t/p/w500/9yFDYxV0LWDtc7VyuaZ36uB9FOy.jpg','1985-06-28',6.2,0),(22423,'Sixteen Candles','en','A teenage girl deals with her parents forgetting her birthday and a crush on her high school\'s heartthrob.','https://image.tmdb.org/t/p/w500/1yDBZiMSVGS1IWWb7B2Rwjdz0Zj.jpg','1984-05-04',6.8,0),(22424,'Midnight Express','en','Billy Hayes is caught attempting to smuggle drugs out of Turkey. The Turkish courts decide to make an example of him, sentencing him to more than 30 years in prison. Hayes has two opportunities for release: the appeals made by his lawyer, his family, and the American government, or the \"Midnight Express\".','https://image.tmdb.org/t/p/w500/mW54BtqVRxrPnoO9gQQjTLJlnuU.jpg','1978-08-31',7.5,0),(22425,'Excalibur','en','A surreal adaptation of Sir Thomas Malory\'s \"Le Morte d\'Arthur\", chronicling Arthur Pendragon\'s conception, his rise to the throne, the search by his Knights of the Round Table for the Holy Grail, and ultimately his death.','https://image.tmdb.org/t/p/w500/cTWF6zkr5mUOnheowKODIijWYcN.jpg','1981-04-10',7,0),(22426,'Por los pelos','es','Juanjo (Antonio Pagudo) is a forty-year-old man who, despite not having low self-esteem due to his baldness, his wife, Inma (Eva Ugarte), obsessed with image and aesthetics, is in charge of making him complex about it. On the other hand, his friend Sebas (Carlos Librado \"Nene\") is affected by his lack of hair and is willing to do whatever it takes to regain his younger version, something that affects his ex-wife, Sofía (Amaia Salamanca) , and their daughters. Ready for anything, both get into a little trouble to get the money to allow them to travel to Turkey and have a hair transplant. In Istanbul they meet Rayco (Tomy Aguilera), a young reggaeton singer who is having great success, but after discovering his alopecia at a concert, he needs an urgent hair transplant. In this way, the three of them will try to seek happiness through aesthetics, but perhaps they will discover that there is something far beyond the physical.','https://image.tmdb.org/t/p/w500/lQdD2FmlLW4GF879nynoZZWBukM.jpg','2022-08-12',7,0),(22427,'Marmaduke','en','When Phil and Debbie Winslow relocate from their native Kansas to the sunny climes of Orange County, their big-hearted, havoc-wreaking Great Dane gets a taste of the dog\'s life, California-style.','https://image.tmdb.org/t/p/w500/e1hxniKMiRIpGiad0BCATn4d8uv.jpg','2010-06-04',5.3,0),(22428,'Eiffel','fr','The government is asking Eiffel to design something spectacular for the 1889 Paris World Fair, but Eiffel simply wants to design the subway. Suddenly, everything changes when Eiffel crosses paths with a mysterious woman from his past.','https://image.tmdb.org/t/p/w500/mrHx1eQpG7d0Qz3PUkt1ceEP6YK.jpg','2021-10-07',6.3,0),(22429,'Mimic','en','A disease carried by common cockroaches is killing Manhattan children. In an effort to stop the epidemic an entomologist, Susan Tyler, creates a mutant breed of insect that secretes a fluid to kill the roaches. This mutant breed was engineered to die after one generation, but three years later Susan finds out that the species has survived and evolved into a large, gruesome monster that can mimic human form.','https://image.tmdb.org/t/p/w500/ieRRo78f8JzEKxfiCKqJyFg6l8o.jpg','1997-08-22',6.1,0),(22430,'King of Kings','en','Who is Jesus, and why does he impact all he meets? He is respected and reviled, emulated and accused, beloved, betrayed, and finally crucified. Yet that terrible fate would not be the end of the story.','https://image.tmdb.org/t/p/w500/fp1Nx4FASTGldFuQyGXN0HF6Jgk.jpg','1961-10-11',7.1,0),(22431,'Abduction','en','A man steps out of a park fountain in Ho Chi Minh City with no recollection of who he is or where he came from. As he wanders through the city, piecing together clues to his past, he is relentlessly pursued by mysterious figures.','https://image.tmdb.org/t/p/w500/3zeEoWFqz5piolP0TQSIIsm6x8U.jpg','2019-03-20',6.2,0),(22432,'Heart Shot','en','Teenagers Nikki and Sam are in love and planning their future together — until Nikki\'s dangerous past returns to threaten everything.','https://image.tmdb.org/t/p/w500/ubaCN0FjWhxiu1uHhI9oXSgalVK.jpg','2022-02-17',5.7,0),(22433,'Patricia, A Hidden Passion','es','Patricia is a successful couples therapist. Your marriage is going through a bad time. But when she meets a student, Pablo will transform her own beliefs about sex.','https://image.tmdb.org/t/p/w500/tWVppr1BlawmBWrlOOGIfr0ujH.jpg','2020-01-21',6.1,0),(22434,'Lady Bloodfight','en','Jane is a beautiful but troubled American girl backpacking through Japan, when her raw street fighting skills draw the attention of Oshima, Japanese karate champion, who recruits and trains her to fight in the vicious, all-female, underground martial arts tournament known as \"The Kumite\". After months of rigorous preparation, Jane is ready to face off against the deadliest female fighters in the world, including Ling, the Chinese apprentice of Oshima\'s nemesis. But other nefarious forces lie in the shadows, and Jane and Ling will have to unite on a journey that will take them from the gritty underworld of Hong Kong to the glitz of Macao, before deciding who really is the best female fighter on the planet.','https://image.tmdb.org/t/p/w500/ezcYsF2k1wJLuAINo8xhzub6JK6.jpg','2016-11-11',6.7,0),(22435,'The Last House on the Left','en','Two teenage girls try to buy marijuana in the city - where they get kidnapped and brutalized by a gang of psychotic convicts.','https://image.tmdb.org/t/p/w500/iMeXdKEvSeoEh4WfDFQamaHZlG3.jpg','1972-08-30',6,0),(22436,'Precious','en','Set in Harlem in 1987, Claireece \"Precious\" Jones is a 16-year-old African American girl born into a life no one would want. She\'s pregnant for the second time by her absent father; at home, she must wait hand and foot on her mother, an angry woman who abuses her emotionally and physically. School is chaotic and Precious has reached the ninth grade with good marks and a secret; She can\'t read.','https://image.tmdb.org/t/p/w500/cY23k6VQsHVfTQIHf7e887iAfq4.jpg','2009-11-06',7.4,0),(22437,'Notes on a Scandal','en','A veteran high school teacher befriends a younger art teacher, who is having an affair with one of her 15-year-old students. However, her intentions with this new \"friend\" also go well beyond platonic friendship.','https://image.tmdb.org/t/p/w500/ymFybaA0r7MpwWnmUCFHYAT6Djb.jpg','2006-12-25',7.1,0),(22438,'Rogue','en','Battle-hardened O’Hara leads a lively mercenary team of soldiers on a daring mission: rescue hostages from their captors in remote Africa. But as the mission goes awry and the team is stranded, O’Hara’s squad must face a bloody, brutal encounter with a gang of rebels.','https://image.tmdb.org/t/p/w500/uOw5JD8IlD546feZ6oxbIjvN66P.jpg','2020-08-20',5.6,0),(22439,'Barbershop','en','A day in the life of a barbershop on the south side of Chicago. Calvin, who inherited the struggling business from his deceased father, views the shop as nothing but a burden and waste of his time. After selling the shop to a local loan shark, Calvin slowly begins to see his father\'s vision and legacy and struggles with the notion that he just sold it out.','https://image.tmdb.org/t/p/w500/up8cEgEsl2Dq5Djb9lMZYBK0s84.jpg','2002-04-01',6.3,0),(22440,'Underdog','en','A lab accident gives a hound named Shoeshine some serious superpowers -- a secret that the dog eventually shares with the young boy who becomes his owner and friend.','https://image.tmdb.org/t/p/w500/pqGahPUmqrXbkeTQg7HCUa4VeHV.jpg','2007-08-03',5.4,0),(22441,'Wander','en','After getting hired to probe a suspicious death in the small town of Wander, a mentally unstable private investigator becomes convinced the case is linked to the same \'conspiracy cover up\' that caused the death of his daughter.','https://image.tmdb.org/t/p/w500/2AwPvNHphpZBJDqjZKVuMAbvS0v.jpg','2020-12-04',5.4,0),(22442,'Summer of 84','en','After suspecting that their police officer neighbor is a serial killer, a group of teenage friends spend their summer spying on him and gathering evidence, but as they get closer to discovering the truth, things get dangerous','https://image.tmdb.org/t/p/w500/qPitgXPCIFh23yCEjqnCZnfhBig.jpg','2018-08-10',6.9,0),(22443,'The Rocky Horror Picture Show','en','Sweethearts Brad and Janet, stuck with a flat tire during a storm, discover the eerie mansion of Dr. Frank-N-Furter, a transvestite scientist. As their innocence is lost, Brad and Janet meet a houseful of wild characters, including a rocking biker and a creepy butler. Through elaborate dances and rock songs, Frank-N-Furter unveils his latest creation: a muscular man named \'Rockv\'.','https://image.tmdb.org/t/p/w500/3pyE6ZqDbuJi7zrNzzQzcKTWdmN.jpg','1975-08-14',7.5,0),(22444,'Airport \'77','en','Flight 23 has crashed in the Bermuda Triangle after a hijacking gone wrong. Now the surviving passengers must brave panic, slow leaks, oxygen depletion, and more while attempting a daring plan, all while 200 feet underwater.','https://image.tmdb.org/t/p/w500/m9b3frZR0Wu8I3ayN3QPrxfZMvC.jpg','1977-03-11',5.6,0),(22445,'2-Headed Shark Attack','en','A Semester at Sea ship is attacked and sunk by a mutated two-headed shark, and the survivors seek refuge on a deserted atoll. The coeds, however, are no longer safe when the atoll starts flooding.','https://image.tmdb.org/t/p/w500/tyKDKlex5RqBjx3OatVpTAfeAkD.jpg','2012-06-26',4.4,0),(22446,'Teen Wolf Too','en','Although awkward college student Todd Howard is particularly adept at science, he\'s paying for school with an athletic scholarship that he will lose should he not fare well in an upcoming boxing tournament. Luckily for Todd, he has inherited the same family curse that once turned his cousin into a werewolf. As he transforms into the hairy, fanged, howling monster, he finds both his physical agility and his popularity skyrocketing -- but at what cost?','https://image.tmdb.org/t/p/w500/pFNzeyxgUwuPqlAhOVPlDupu1Ov.jpg','1987-11-20',4.1,0),(22447,'Doubt','en','In 1964, a Catholic school nun questions a priest\'s ambiguous relationship with a troubled young student, suspecting him of abuse. He denies the charges.','https://image.tmdb.org/t/p/w500/9lypT2ghNuUPYVJf66oe4fKvUqI.jpg','2008-02-27',7.2,0),(22448,'Come True','en','Looking for an escape from her recurring nightmares, 18-year-old Sarah submits to a university sleep study, but soon realizes she\'s become the conduit to a frightening new discovery.','https://image.tmdb.org/t/p/w500/hGPGRRz6FTIRed1zestdWrV2Iwd.jpg','2020-09-24',6.1,0),(22449,'New Gods: Yang Jian','zh','Thirteen years after Yang Jian (known to some as Erlang Shen) imprisoned his sister beneath a mountain, the once powerful god now scrapes by as a penniless bounty hunter. When a mysterious woman hires him for a new job, Yang Jian soon finds himself chasing down a familiar figure. He must stop Chenxiang, his long-lost nephew, who is in search of the magical lotus lantern that will free his mother, even if it will bring catastrophe. As Yang Jian confronts the actions of his past, he must face a host of dangerous vigilantes seeking the same treasure with the power to alter the balance of their worlds.','https://image.tmdb.org/t/p/w500/tW5dFOemV4d7hxTcVI2bu4u0C9z.jpg','2022-08-19',6.6,0),(22450,'Two Night Stand','en','After an extremely regrettable one night stand, two strangers wake up to find themselves snowed in after sleeping through a blizzard that put all of Manhattan on ice. They\'re now trapped together in a tiny apartment, forced to get to know each other way more than any one night stand should.','https://image.tmdb.org/t/p/w500/rz0YnlHieXP9SBuJU4ANBW8ttIw.jpg','2014-09-26',6.4,0),(22451,'The Last King of Scotland','en','Young Scottish doctor, Nicholas Garrigan decides it\'s time for an adventure after he finishes his formal education, so he decides to try his luck in Uganda, and arrives during the downfall of President Obote. General Idi Amin comes to power and asks Garrigan to become his personal doctor.','https://image.tmdb.org/t/p/w500/mTtgpH6UnHUtD8moRJUzfGLOZTj.jpg','2006-01-12',7.4,0),(22452,'Easy Rider','en','A cross-country trip to sell drugs puts two hippie bikers on a collision course with small-town prejudices.','https://image.tmdb.org/t/p/w500/mmGEB6ly9OG8SYVfvAoa6QqHNvN.jpg','1969-06-26',7.1,0),(22453,'Little Shop of Horrors','en','Seymour Krelborn is a nerdy orphan working at Mushnik\'s, a flower shop in urban Skid Row. He harbors a crush on fellow co-worker Audrey Fulquard, and is berated by Mr. Mushnik daily. One day Seymour finds a very mysterious unidentified plant which he calls Audrey II. The plant seems to have a craving for blood and soon begins to sing for his supper.','https://image.tmdb.org/t/p/w500/iKkbN17OmFosaW6asCNZTTsyvpu.jpg','1986-12-19',6.9,0),(22454,'All About My Mother','es','Following the tragic death of her teenage son, Manuela travels from Madrid to Barcelona in an attempt to contact the long-estranged father the boy never knew. She reunites with an old friend, an outspoken transgender sex worker, and befriends a troubled actress and a pregnant, HIV-positive nun.','https://image.tmdb.org/t/p/w500/hjQhzhkGYXPNM96k0mOgob6HMmn.jpg','1999-04-16',7.7,0),(22455,'Funny People','en','Famous and wealthy funnyman George Simmons doesn\'t give much thought to how he treats people until a doctor delivers stunning health news, forcing George to reevaluate his priorities with a little help from aspiring stand-up comic Ira.','https://image.tmdb.org/t/p/w500/gEYKD5cWCBGg8Za3hhwDBk3gEsP.jpg','2009-07-30',5.8,0),(22456,'Dr. Dolittle 3','en','Lisa Dolittle sends her daughter to \'Durango\', a Dude Ranch, to find herself. While there, she uses her talent to talk to the animals in order to save Durango from being taken over by a neighboring Ranch.','https://image.tmdb.org/t/p/w500/mODEH6RuoL8s9ptF1Mbrq1Z6aYz.jpg','2006-04-25',5.2,0),(22457,'Hope','en','An exhausted couple stop at a diner in the early hours of the morning in the middle of nowhere. Their journey tells a tale of sadness, but what really happened? We begin to understand that the situation they\'re in is far from ordinary.','https://image.tmdb.org/t/p/w500/4CMMM6VKLi99ZxuWmwjswFKSG6t.jpg','2020-11-01',2,0),(22458,'Lamb','is','An Icelandic couple live with their herd of sheep on a beautiful but remote farm. When they discover a mysterious newborn on their land, they decide to keep it and raise it as their own. This unexpected development and the prospects of a new family brings them much joy before ultimately destroying them.','https://image.tmdb.org/t/p/w500/gP9yviboTGWGolqUZKIB1UkF1C2.jpg','2021-08-12',6.5,0),(22459,'T2 Trainspotting','en','After 20 years abroad, Mark Renton returns to Scotland and reunites with his old friends Sick Boy, Spud and Begbie.','https://image.tmdb.org/t/p/w500/xlbpCwa9OXXIiNgXcwuompHFIk9.jpg','2017-01-27',7,0),(22460,'The Fog','en','Trapped within an eerie mist, the residents of Antonio Bay have become the unwitting victims of a horrifying vengeance. One hundred years earlier, a ship carrying lepers was purposely lured onto the rocky coastline and sank, drowning all aboard. Now they\'re back – long-dead mariners who\'ve waited a century for their revenge.','https://image.tmdb.org/t/p/w500/v9vt49PUDJGkrMVjhb3yiYo7H4Y.jpg','2005-10-14',4.5,0),(22461,'Superman III','en','Aiming to defeat the Man of Steel, wealthy executive Ross Webster hires bumbling but brilliant Gus Gorman to develop synthetic kryptonite, which yields some unexpected psychological effects in the third installment of the 1980s Superman franchise. Between rekindling romance with his high school sweetheart and saving himself, Superman must contend with a powerful supercomputer.','https://image.tmdb.org/t/p/w500/c4oR6qgZW2s5foGkQi2Dd86KuAS.jpg','1983-06-17',5.5,0),(22462,'Behaving Badly','en','Teenager Rick Stevens is willing to do whatever it takes to win the heart of Nina Pennington. He\'ll have to deal with his best friend\'s horny mom, a drug abusing boss and even the mob if he ever hopes to land the girl of his dreams. Love is never easy!','https://image.tmdb.org/t/p/w500/vHPRAvYa4AT2KfORbpTlhNGtGEI.jpg','2014-04-14',5.3,0),(22463,'Wither','sv','Ida and Albin are a happy couple. They set off to a cabin in the vast Swedish woodlands to have a fun holiday with their friends. But under the floorboards is an evil that waits to be unleashed.','https://image.tmdb.org/t/p/w500/sJt4PPzKES7hSfVwKcbugk7zWad.jpg','2013-05-04',5.4,0),(22464,'Agatha and the Truth of Murder','en','England, December 1926. Although her personal life is in tatters, the famous writer Agatha Christie decides to leave everything behind to help unravel an unsolved murder committed on a train six years ago, unable to imagine the disproportionate consequences that such a selfless act will cause.','https://image.tmdb.org/t/p/w500/c9RzNEpejLkEBVH7cGNekpec8hS.jpg','2018-12-23',6.2,0),(22465,'El Padrecito','es','Young priest Father Sebastián is assigned to a parish in San Jeronimo el Alto, where he is not welcomed by the community, particularly the resident priest Father Damián. The newcomer gradually earns the trust of the people through humor, but firmly captures their hearts by saving the town fiesta by fighting a bull when the hired torero failed to show. Father Sebastián counsels the townspeople, lecturing them on their duties in a modern society. He used the collection plate to redistribute the town\'s wealth more evenly.','https://image.tmdb.org/t/p/w500/fREvHyV2W1gG1HrBaAbxmXiYE2P.jpg','1964-09-03',7.8,0),(22466,'Railway Heroes','zh','The historical story of an enemy fighting the wits and courage of an extraordinary brave group of ordinary heroes known as the \"Lunan Railway Brigade\" who desperately fight to defend their homeland.','https://image.tmdb.org/t/p/w500/gTjZErHBML0uYYgj7YsL7YiUKMV.jpg','2021-11-19',6.8,0),(22467,'Faster Than Light: the Dream of Interstellar Flight','en','“Faster Than Light” explores the longstanding quest to develop spacecraft with enough power and speed to reach the stars. The film asks: What will it take to reach a newly discovered planet circling our Sun’s nearest neighbor, Proxima Centauri? Based on real science and engineering, “Faster Than Light” takes audiences on a thrilling journey into the future, aboard laser-driven space sails, antimatter engines, and even warp drive – right out of science fiction. “Who can say how far, and how fast, our technology will one day take us?” said director Thomas Lucas.','https://image.tmdb.org/t/p/w500/mbgJxB70uMFK2H8DXHUj5lAMgXx.jpg','2017-06-07',6,0),(22468,'Smokin\' Aces','en','When a Las Vegas performer-turned-snitch named Buddy Israel decides to turn state\'s evidence and testify against the mob, it seems that a whole lot of people would like to make sure he\'s no longer breathing.','https://image.tmdb.org/t/p/w500/nrdnN8WqvyOt8Bnl3hgWcZD6ZyM.jpg','2006-12-09',6.5,0),(22469,'My Octopus Teacher','en','After years of swimming every day in the freezing ocean at the tip of Africa, Craig Foster meets an unlikely teacher: a young octopus who displays remarkable curiosity. Visiting her den and tracking her movements for months on end he eventually wins the animal’s trust and they develop a never-before-seen bond between human and wild animal.','https://image.tmdb.org/t/p/w500/hvTVZb7hBC8tZAGoEhH5eiMJu2B.jpg','2020-09-04',7.9,0),(22470,'Land of the Lost','en','On his latest expedition, Dr. Rick Marshall is sucked into a space-time vortex alongside his research assistant and a redneck survivalist. In this alternate universe, the trio make friends with a primate named Chaka, their only ally in a world full of dinosaurs and other fantastic creatures.','https://image.tmdb.org/t/p/w500/wpX0SnZI7XyXlL8UfvmmeThkmgw.jpg','2009-06-05',5.4,0),(22471,'L\'orgia','ca','A group of boys and girls are locked up a weekend in a friends house in which they do a party that little to little is converted in an orgy. But not everything is sex, there are also cinematographic digressions, chocolate and churros, and good humor.','https://image.tmdb.org/t/p/w500/gdsH3ioXgA7vW9mQqtWu0t0AuVj.jpg','1978-11-26',4.3,0),(22472,'Pixie Hollow Bake Off','en','Tink challenges Gelata to see who can bake the best cake for the queen\'s party.  Plus 10 Disney Fairies Mini-Shorts:  - Just Desserts  - If The Hue Fits  - Dust Up  - Scents And Sensibility  - Just One Of The Girls  - Volleybug  - Hide And Tink  - Rainbow\'s Ends  - Fawn And Games  - Magic Tricks','https://image.tmdb.org/t/p/w500/6iXYe7AkQ1QIfMFuvXsSCT2zF7s.jpg','2013-10-20',7.1,0),(22473,'Keeping Up with the Joneses','en','An ordinary suburban couple finds it’s not easy keeping up with the Joneses – their impossibly gorgeous and ultra-sophisticated new neighbors – especially when they discover that Mr. and Mrs. “Jones” are covert operatives.','https://image.tmdb.org/t/p/w500/yvWcTrRCzE4C2hkd2wV4erPuKCn.jpg','2016-10-20',6.1,0),(22474,'American Carnage','en','After a governor issues an executive order to arrest the children of undocumented immigrants, the detained youth are offered an opportunity to have their charges dropped by volunteering to provide care to the elderly. Once inside the elder care facility, however, they discover more twisted secrets than they could have possibly imagined.','https://image.tmdb.org/t/p/w500/zQmwQqtT2KEfg5IO5u8lexZoCAR.jpg','2022-07-15',5.7,0),(22475,'Avengers Grimm: Time Wars','en','When Rumpelstiltskin tries to take over Earth once and for all, The Avengers Grimm must track him down through time in order to defeat him.','https://image.tmdb.org/t/p/w500/xfAcu74DRQXeM9XqFcE5MrSRzYP.jpg','2018-05-01',4.8,0),(22476,'After Yang','en','When his young daughter\'s beloved companion — an android named Yang — malfunctions, Jake searches for a way to repair him. In the process, Jake discovers the life that has been passing in front of him, reconnecting with his wife and daughter across a distance he didn\'t know was there.','https://image.tmdb.org/t/p/w500/qjEuDeKOhA7JqaaqhLSfoS9titb.jpg','2022-03-04',6.5,0),(22477,'Mortdecai','en','An art dealer, Charles Mortdecai, searches for a stolen painting rumored to contain a secret code that gains access to hidden Nazi gold.','https://image.tmdb.org/t/p/w500/j7eKGD0n1zRVfKMX6M1kpfavby7.jpg','2015-01-21',5.5,0),(22478,'Zoo','en','Young Tom and his misfit friends fight to save \'Buster\' the baby elephant during the German air raid bombings of Belfast in 1941.','https://image.tmdb.org/t/p/w500/tUlO39EcZzPlKS4JOhlUansgKFJ.jpg','2018-06-08',6.7,0),(22479,'Goodbye Christopher Robin','en','The behind the scenes story of the life of A.A. Milne and the creation of the Winnie the Pooh stories inspired by his son Christopher Robin.','https://image.tmdb.org/t/p/w500/a6IK3hMlUHzXZZVLBTh0WZ5KoAb.jpg','2017-09-29',7.1,0),(22480,'It\'s a Boy Girl Thing','en','A visit to a natural history museum proves catastrophic for two high school rivals, an overachiever and a jock, when an ancient Aztec statue casts a spell that causes them to switch bodies and see exactly what it\'s like to walk in the other\'s shoes.','https://image.tmdb.org/t/p/w500/uA4ZJdlILmIGSqBjfM4mkWvtcTt.jpg','2006-07-15',6.5,0),(22481,'I Kill Giants','en','Sophia, a new high school student, tries to make friends with Barbara, who tells her that “she kills giants,” protecting this way her hometown and its inhabitants, who do not understand her strange behavior.','https://image.tmdb.org/t/p/w500/cvit6HDbXHE6W5kGPd47jd0wthQ.jpg','2018-01-21',6.2,0),(22482,'Scooby-Doo! and the Loch Ness Monster','en','While the gang travel to Scotland to visit Daphne\'s cousin and witness the Highland Games, they find themselves terrorized by the legendary Loch Ness Monster.','https://image.tmdb.org/t/p/w500/cQPkdWGPGoT87OEfVCwcVz6Zw8y.jpg','2004-06-21',7.4,0),(22483,'The Girl Who Killed Her Parents','pt','Based on one of the most shocking and gruesome murder cases in Brazil, the film presents Daniel Cravinhos\'s point of view of the events that led to the death of Marísia and Manfred von Richthofen, his girlfriend’s parents.','https://image.tmdb.org/t/p/w500/7gqZyGlLjNKXIk8RBswqAGJygVz.jpg','2021-09-24',6.4,0),(22484,'Stitches','en','The clumsy and unfunny clown Richard \"Stitches\" Grindle entertains at the 10th birthday party of little Tom, but the boy and his friends play a prank with Stitches, tying his shoelaces. Stitches slips, falls and dies. Six years later, Tom gives a birthday party for his friends at home, but Stitches revives to haunt the teenagers and revenge his death.','https://image.tmdb.org/t/p/w500/krlOnkMBDYp4zgLivd4WORBnQm0.jpg','2012-05-19',6.4,0),(22485,'The Possession of Michael King','en','The film tells the story of documentary filmmaker Michael King (Shane Johnson), who doesn’t believe in God or the Devil. Following the sudden death of his wife, Michael decides to make his next film about the search for the existence of the supernatural, making himself the center of the experiment – allowing demonologists, necromancers, and various practitioners of the occult to try the deepest and darkest spells and rituals they can find on him – in the hopes that when they fail, he’ll once and for all have proof that religion, spiritualism, and the paranormal are nothing more than myth. But something does happen. An evil and horrifying force has taken over Michael King. And it will not let him go.','https://image.tmdb.org/t/p/w500/r1LrvbUsQHn8ByJIOoeI76F6jR0.jpg','2014-08-14',6,0),(22486,'Super Bodyguard','zh','','https://image.tmdb.org/t/p/w500/1hpecrd4rCIOxTz09uAStvIsltl.jpg','2021-04-22',6,0),(22487,'The 33D Invader','zh','A young woman named Future is sent from the year 2046 to the year 2011 in Hong Kong. Future was sent by the United Nations in order to get pregnant, where she can then extract her genes and repopulate the earth as 99% of males have become infertile in the future due to attacks from Planet Xucker. Two assassins from Xuckler are sent after her to stop her. Future meets three University students: Felix, Dan-san and Sing. The men are obsessed with female students next door: Chin-chin, Chen-chen and Sai-sai. The students agree to help Future find a mate at the university.','https://image.tmdb.org/t/p/w500/bBC1fBHyFBmc6fn4UDedtkOVSaD.jpg','2011-10-06',5.1,0),(22488,'In the Line of Fire','en','Veteran Secret Service agent Frank Horrigan is a man haunted by his failure to save President Kennedy while serving protection detail in Dallas. Thirty years later, a man calling himself \"Booth\" threatens the life of the current President, forcing Horrigan to come back to protection detail to confront the ghosts from his past.','https://image.tmdb.org/t/p/w500/3NvOFpmyECI3DNExYMtFIRcGMsu.jpg','1993-07-08',7,0),(22489,'Locked Down','en','During a COVID-19 lockdown, sparring couple Linda and Paxton call a truce to attempt a high-risk jewellery heist at one of the world\'s most exclusive department stores, Harrods.','https://image.tmdb.org/t/p/w500/svHelD0Hb3TXPAQoPsoBwdDMTvf.jpg','2021-02-25',5.4,0),(22490,'All the Money in the World','en','The story of the kidnapping of 16-year-old John Paul Getty III and the desperate attempt by his devoted mother to convince his billionaire grandfather Jean Paul Getty to pay the ransom.','https://image.tmdb.org/t/p/w500/q6nE9Hf0ezszjI4DbCxwzQ73MMy.jpg','2017-12-21',6.5,0),(22491,'Forever Rich','nl','This is the story of Richie and his journey to become the greatest rap-artist in the Netherlands. One evening he is violently mugged by a group of teenagers and loses his most prized possession: an expensive watch. When images of the humiliating robbery go viral, Richie\'s hard-earned reputation is damaged.','https://image.tmdb.org/t/p/w500/vRbX9sTiZheczEtNfjAi0bhHPAn.jpg','2021-10-01',6.6,0),(22492,'The Captive','en','Eight years after the disappearance of Cassandra, some disturbing incidents seem to indicate that she\'s still alive. Police, parents and Cassandra herself, will try to unravel the mystery of her disappearance.','https://image.tmdb.org/t/p/w500/wLoFxTZFEfAzFLk2qSoPbcz58Jb.jpg','2014-08-09',5.8,0),(22493,'Far and Away','en','A young man leaves Ireland with his landlord\'s daughter after some trouble with her father, and they dream of owning land at the big giveaway in Oklahoma ca. 1893. When they get to the new land, they find jobs and begin saving money. The man becomes a local barehands boxer, and rides in glory until he is beaten, then his employers steal all the couple\'s money and they must fight off starvation in the winter, and try to keep their dream of owning land alive. Meanwhile, the woman\'s parents find out where she has gone and have come to America to find her and take her back.','https://image.tmdb.org/t/p/w500/rbxvGXcD7fixrAsbiAYl9R76uDs.jpg','1992-05-22',6.7,0),(22494,'Kiss the Girls','en','Forensic psychologist Alex Cross travels to North Carolina and teams with escaped kidnap victim Kate McTiernan to hunt down \"Casanova,\" a serial killer who abducts strong-willed women and forces them to submit to his demands. The trail leads to Los Angeles, where the duo discovers that the psychopath may not be working alone.','https://image.tmdb.org/t/p/w500/25h5I3E3ydhazsPDnscWHivq5pn.jpg','1997-09-29',6.5,0),(22495,'Stars Fell on Alabama','en','Successful Hollywood agent Bryce Dixon is returning to Alabama for the first time in 15 years for his high school reunion. When he learns he\'s the only one of his friends who isn\'t married with children, he convinces his client, starlet Madison Belle, to pretend to be his girlfriend. But he soon learns that success has different meanings, and romance may be closer than he thinks.','https://image.tmdb.org/t/p/w500/7EyZ85HLyzD0dCp12aAqIPTkTTT.jpg','2021-01-06',6.5,0),(22496,'The Scarlet Letter','en','Set in puritanical Boston in the mid 1600s, the story of seamstress Hester Prynne, who is outcast after she becomes pregnant by a respected reverend. She refuses to divulge the name of the father, is \"convicted\" of adultery and forced to wear a scarlet \"A\" until an Indian attack unites the Puritans and leads to a reevaluation of their laws and morals.','https://image.tmdb.org/t/p/w500/8gIU7O3oV6NyWUjlL6ppbpnIZLW.jpg','1995-10-13',6,0),(22497,'The Tale of Despereaux','en','Once upon a time... in the far away kingdom of Dor... lived a brave and virtuous mouse with comically oversized ears who dreamt of becoming a knight. Banished from his home for having such lofty ambitions, Despereaux sets off on an amazing adventure with his good-hearted rat friend Roscuro, who leads him, at long last, on a very noble quest to rescue an endangered princess and save an entire kingdom from darkness.','https://image.tmdb.org/t/p/w500/yADB4GsH2AvSHPsBVGjj8wByonk.jpg','2008-12-18',6,0),(22498,'Just Say Yes','nl','Incurable romantic Lotte finds her life upended when her plans for a picture-perfect wedding unravel -- just as her self-absorbed sister gets engaged.','https://image.tmdb.org/t/p/w500/3btDwus5VN5jOWfA9strpDJWwfj.jpg','2021-04-02',6.5,0),(22499,'Christmas Inheritance','en','To inherit her father\'s company, socialite Ellen must first visit his small hometown, where she learns the value of hard work and helping others.','https://image.tmdb.org/t/p/w500/sqdbF40nBzS2IZVAGPxJT7loxoM.jpg','2017-12-15',6.3,0),(22500,'Asterix the Gaul','fr','In the year 50 BC, Gaul is occupied by the Romans - nearly. But the small village of Asterix and his friends still resists the Roman legions with the aid of their druid\'s magic potion, which gives superhuman strength. Learning of this potion, a Roman centurion kidnaps the druid to get the secret formula out of him.','https://image.tmdb.org/t/p/w500/jBDZ68iRPEhrWouioAcSiG8t5Jc.jpg','1967-12-20',6.4,0),(22501,'Arctic Dogs','en','Animals band together to save the day when the evil Otto Von Walrus hatches a sinister scheme to accelerate global warming and melt the Arctic Circle.','https://image.tmdb.org/t/p/w500/5YHjyjd2N0ZXcnGuB8G1nIa6h9t.jpg','2019-11-01',6.3,0),(22502,'A Perfect World','en','A kidnapped boy strikes up a friendship with his captor: an escaped convict on the run from the law, headed by an honorable U.S. Marshal.','https://image.tmdb.org/t/p/w500/1II9kMjOuho3pnEvxkpx7e3ozOO.jpg','1993-11-24',7.5,0),(22503,'Dogma','en','The latest battle in the eternal war between Good and Evil has come to New Jersey in the late, late 20th Century. Angels, demons, apostles and prophets (of a sort) walk among the cynics and innocents of America and duke it out for the fate of humankind.','https://image.tmdb.org/t/p/w500/xI5beD8Td79E2uZNAxgd1gWWOEd.jpg','1999-11-12',6.9,0),(22504,'Relyebo','tl','A security guard is charmed by a hot tenant he calls Ms. F. His sexual fantasy will take him to the extreme that will change his and his wife\'s lives forever.','https://image.tmdb.org/t/p/w500/6AmAAOEYP48L57PFxwBb77ko3pg.jpg','2022-10-14',6,0),(22505,'Unicorn Wars','es','An army of bear cubs train and indoctrinate young recruits for the war against the unicorns, which threatens the safety of the cubs. Brothers Bluet and Tubby, along with a group of inexperienced cadets, are sent on a dangerous mission to save the Magic Forest, where the unicorns live, and start a terrible battle.','https://image.tmdb.org/t/p/w500/8KBj11zBaRdhoeq1q9jcAwKmDSk.jpg','2022-12-28',7.5,0),(22506,'Caligula and Messalina','fr','Messalina (played by gorgeous Betty Roland) is a power-hungry nymphomaniac who will stop at nothing to become Empress of Rome. She brings herself to the attention of Caligula by battling in the gladiator arena and it is not long before she achieves her goal, upsetting the Emperor\'s youngest sister Agrippina, who hopes that her son Nero will eventually become ruler of Rome. Agrippina successfully plots Caligula\'s downfall, but Messalina rains on her parade by immediately jumping into the sack with his successor, Claudius. But naughty old Messalina can\'t commit herself to one man, and shags everyone in sight, including a grotesque, but well-endowed, frequenter of brothels, a randy midget, her eunuch(!?!?) and an ex-lover. When she ends up pregnant, and it is obvious that the father is not Claudius (since he has been away fighting in foreign lands), Agrippina finally sees her opportunity to be rid of her nemesis once and for all.','https://image.tmdb.org/t/p/w500/ywzH1Raa5yuiizsqEZzqH8fgY1M.jpg','1981-01-01',4,0),(22507,'Deep Rising','en','A group of heavily armed hijackers board a luxury ocean liner in the South Pacific Ocean to loot it, only to do battle with a series of large-sized, tentacled, man-eating sea creatures who have taken over the ship first.','https://image.tmdb.org/t/p/w500/fCRNZE9HVeMT7T7A5aU3DLxANCX.jpg','1998-01-30',6.2,0),(22508,'Afternoon Delight','en','Rachel is a quick-witted and lovable stay-at-home mom. Frustrated with the realities of preschool auctions, a lacklustre sex life and career that\'s gone kaput, she visits a strip club to spice up her marriage and meets McKenna, a stripper she adopts as her live-in nanny.','https://image.tmdb.org/t/p/w500/qlgPBk5xZzHHPfrimBFV46QuktX.jpg','2013-08-30',5.8,0),(22509,'Maquíllame Otra Vez','es','','https://image.tmdb.org/t/p/w500/hAKV3WLdHOL313IImAoR2GFWC1W.jpg','2023-02-09',2,0),(22510,'A Shaun the Sheep Movie: Farmageddon','en','When an alien with amazing powers crash-lands near Mossy Bottom Farm, Shaun the Sheep goes on a mission to shepherd the intergalactic visitor home before a sinister organization can capture her.','https://image.tmdb.org/t/p/w500/p08FoXVFgcRm5QZBaGj0VKa2W2Y.jpg','2019-09-26',6.9,0),(22511,'The Zookeeper\'s Wife','en','The account of keepers of the Warsaw Zoo, Jan and Antonina Zabinski, who helped save hundreds of people and animals during the Nazi invasion.','https://image.tmdb.org/t/p/w500/50KGpMiIvSkF4WHOgp0gM6r6sMU.jpg','2017-03-24',7.4,0),(22512,'Die in a Gunfight','en','Mary and Ben are the star-crossed black sheep of two powerful families engaged in a centuries-long feud. When the pair reignite a romance after many years apart, their forbidden love draws a motley assortment of schemers and killers into their orbit, and as fists and bullets fly, it becomes clear that violent delights will have violent ends.','https://image.tmdb.org/t/p/w500/byXLJZq5vfveYdAWaC4uMtojsWj.jpg','2021-07-01',5.5,0),(22513,'So Undercover','en','When the FBI hires her to go undercover at a college sorority, Molly Morris (Miley Cyrus) must transform herself from a tough, streetwise private investigator to a refined, sophisticated university girl to help protect the daughter of a one-time Mobster. With several suspects on her list, Molly unexpectedly discovers that not everyone is who they appear to be, including herself.','https://image.tmdb.org/t/p/w500/abR6e0FaWwwcEJEM4PY5VvjwBr1.jpg','2012-12-06',6.2,0),(22514,'A Good Year','en','Failed London banker Max Skinner inherits his uncle\'s vineyard in Provence, where he spent many childhood holidays. Upon his arrival, he meets a woman from California who tells Max she is his long-lost cousin and that the property is hers.','https://image.tmdb.org/t/p/w500/vWBpDuv1oluhbVqF6McyBwzpJNQ.jpg','2006-09-09',6.7,0),(22515,'Maybe I Do','en','Michelle and Allen, who have reached the point in their relationship where they are considering next steps, decide to invite  their parents to finally meet and to offer some understanding of why marriage works. Except the parents already know each other quite well, which leads to some very distinct opinions about the value of marriage.','https://image.tmdb.org/t/p/w500/vj649F5QB3OQbTKqpMX3UiCkp5q.jpg','2023-01-27',5,0),(22516,'Ski Girls','fi','Ski Girls tells about four friends who have visited different ski resorts every year since their youth. They call themselves Ski Girls,  even though they never ski and can no longer be called girls either.  This time they are reunited for Emma\'s wedding. Emma\'s fifth wedding, that is. Their friendship will be tested as the other Ski Girls decide to stop Emma from making another mistake by getting married.','https://image.tmdb.org/t/p/w500/rhZ9OM03uolVsOCZ2yOLdM8sCSW.jpg','2023-02-10',0,0),(22517,'Meet Dave','en','A crew of miniature aliens operate a spaceship that has a human form. While trying to save their planet, the aliens encounter a new problem, as their ship becomes smitten with an Earth woman.','https://image.tmdb.org/t/p/w500/3Qfav5aVRcZmq854olMjJ795JJ2.jpg','2008-07-08',5.3,0),(22518,'Silent Night','en','Nell, Simon, and their boy Art are ready to welcome friends and family for what promises to be a perfect Christmas gathering. Perfect except for one thing: everyone is going to die.','https://image.tmdb.org/t/p/w500/bfUO1SBTfgcK77em3lOuRFY2uLc.jpg','2021-12-03',6.1,0),(22519,'Jimmy Neutron: Boy Genius','en','Jimmy Neutron is a boy genius and way ahead of his friends, but when it comes to being cool, he\'s a little behind. All until one day when his parents, and parents all over Earth are kidnapped by aliens, it\'s up to him to lead all the children of the world to rescue their parents.','https://image.tmdb.org/t/p/w500/pUwdquA6Bf3Gq8yT5iQL1Yq0jkl.jpg','2001-12-21',5.9,0),(22520,'Lake Placid 3','en','A game warden moves his family to Lake Placid, once the site of deadly crocodile attacks. Locals assure him the crocs are gone, but his mischievous young son finds a few baby crocs and begins feeding them. They quickly grow into very big adults and start attacking the game warden\'s family and nearby town.','https://image.tmdb.org/t/p/w500/aHH3fy5ZVs4nrzNLZYIe1p2PJSc.jpg','2010-08-21',5.2,0),(22521,'The Reaping','en','Katherine Morrissey, a former Christian missionary, lost her faith after the tragic deaths of her family. Now she applies her expertise to debunking religious phenomena. When a series of biblical plagues overrun a small town, Katherine arrives to prove that a supernatural force is not behind the occurrences, but soon finds that science cannot explain what is happening. Instead, she must regain her faith to combat the evil that waits in a Louisiana swamp.','https://image.tmdb.org/t/p/w500/o8Vl4Vxp5LBth9J6Aa3k6PAefxt.jpg','2007-04-05',5.7,0),(22522,'Hunt for the Wilderpeople','en','Ricky is a defiant young city kid who finds himself on the run with his cantankerous foster uncle in the wild New Zealand bush. A national manhunt ensues, and the two are forced to put aside their differences and work together to survive.','https://image.tmdb.org/t/p/w500/hkmz9rxgcweizXNElozGeKwmAJE.jpg','2016-03-31',7.7,0),(22523,'Batman vs. Robin','en','Damian Wayne is having a hard time coping with his father\'s \"no killing\" rule. Meanwhile, Gotham is going through hell with threats such as the insane Dollmaker, and the secretive Court of Owls.','https://image.tmdb.org/t/p/w500/aGp9XDXmVM5lCKHWtgBC15S7XLr.jpg','2015-04-14',7.2,0),(22524,'Sabrina','en','An ugly duckling having undergone a remarkable change, still harbors feelings for her crush: a carefree playboy, but not before his business-focused brother has something to say about it.','https://image.tmdb.org/t/p/w500/z1oNjotUI7D06J4LWQFQzdIuPnf.jpg','1995-12-15',6.2,0),(22525,'The House of the Spirits','en','A rancher, his clairvoyant wife and their family face turbulent years in South America.','https://image.tmdb.org/t/p/w500/q0YyNTvooXI9ZF71dAYKcRwqlGn.jpg','1993-10-19',6.9,0),(22526,'Zombie Shark','en','A perfect getaway weekend turns into a nightmare for four friends who find themselves fighting for their lives against an experimental shark. In order to survive they must fight sharks, zombies, and shark zombies.','https://image.tmdb.org/t/p/w500/agGwR9RRScBS7DwBg4SU81tzvud.jpg','2015-07-20',4.2,0),(22527,'Happily N\'Ever After','en','An alliance of evil-doers, led by Frieda, looks to take over Fairy Tale Land. But when Ella realizes her stepmother is out to ruin her storybook existence, she takes a dramatic turn and blossoms into the leader of the resistance effort.','https://image.tmdb.org/t/p/w500/MjfHDN5WrV6RBVhCvfdlPpt7gH.jpg','2007-01-05',4.9,0),(22528,'Barbie in Princess Power','en','Barbie is Kara - a modern-day princess with a normal life. Kissed by a butterfly which gives her superpowers and allows her to become a Super Sparkle, she is ready to save the kingdom from evil - were it not for her jealous cousin who is also kissed by the butterfly and becomes her rival and nemesis. Watch as Super Sparkle and Dark Sparkle learn that together they can become a great team for good once they learn the power of friendship.','https://image.tmdb.org/t/p/w500/nCviAdChxibrKRZfvG7MZ2wsqdR.jpg','2015-01-29',6.2,0),(22529,'Assassin 33 A.D.','en','When a billionaire gives a group of young scientists unlimited resources to study the science of matter transfer, the scientists unlock the secrets of time travel. But they soon find out that the project is backed by a militant extremist group, and the billionaire plans to go back in time and prove that Jesus never rose from the dead.','https://image.tmdb.org/t/p/w500/8jDvtdH327I8TgX3UPdkAsZF1dA.jpg','2020-01-24',5.2,0),(22530,'Stewie Griffin: The Untold Story','en','The major sub-plot circles around the youngest Griffin, Stewie, who has a near-death experience at a pool when a lifeguard chair falls on him, but he survives. After having a vision of being in Hell, he decides to change his ways, but this doesn\'t last long. While watching television, he and Brian spot a man that looks like Stewie. Brian is convinced that he is Stewie\'s real father, until Stewie learns that the man is actually himself as an adult, taking a vacation from his own time period. Baby Stewie visits thirty years later to discover that his adult self, going by the name Stu, is a single blue-collar middle-aged virgin working at a Circuit City-type store. Meanwhile, Peter and Lois are trying to teach their two older kids, Meg and Chris, to date. In the future, Chris, who hasn\'t changed much, is working as a cop and is married to a foul-mouthed hustler named Vanessa. Meg is now called Ron, since she had a sex-change after college. Written by pepperann210','https://image.tmdb.org/t/p/w500/mro2I5vlcwn2XHwgSDwk1DvhanM.jpg','2005-07-23',6.9,0),(22531,'The Calm Beyond','cn','A young woman lives, hidden in plain sight in a ruined Hong Kong building after a tsunami destroyed the city - A castaway on a concrete island. Her concealed existence is changed forever when a small child literally floats into her life.','https://image.tmdb.org/t/p/w500/bGVQK3vuidHYey8MMyIvVnoh2zp.jpg','2020-10-16',7.7,0),(22532,'Respect','en','The rise of Aretha Franklin’s career from a child singing in her father’s church’s choir to her international superstardom.','https://image.tmdb.org/t/p/w500/iUtPwOBZJc8uJnDqlCXTibdgxKz.jpg','2021-08-12',6.9,0),(22533,'Piglet\'s Big Movie','en','When the gang from the Hundred Acre Wood begin a honey harvest, young Piglet is excluded and told that he is too small to help. Feeling inferior, Piglet disappears and his pals Eeyore, Rabbit, Tigger, Roo and Winnie the Pooh must use Piglet\'s scrapbook as a map to find him. In the process they discover that this very small animal has been a big hero in a lot of ways.','https://image.tmdb.org/t/p/w500/cytspPjtacOInHroA6h2dIekDrp.jpg','2003-03-16',6.7,0),(22534,'Mortal Kombat: Rebirth','en','MORTAL KOMBAT: REBIRTH is a short film released by Kevin Tancharoen (Director) in 2010. It was originally made as a proof of concept for Tancharoen\'s pitch to Warner Brothers for a reboot movie franchise. This 8-minute short features an intricate fight scene choreographed by Larnell Stovall. It also reintroduces classic Mortal Kombat characters, including: Jax (Michael Jai White), Sonya Blade (Jeri Ryan), Johnny Cage (Matt Mullins), Scorpion (Ian Anthony Dale), Baraka (Lateef Crowder) and Shang Tsung (James Lew).','https://image.tmdb.org/t/p/w500/78JIw8JICcPKDIURCJJq2F43iIZ.jpg','2010-06-08',6.7,0),(22535,'Stripes','en','John Winger, an indolent sad sack in his 30s, impulsively joins the U.S. Army after losing his job, his girlfriend and his apartment.','https://image.tmdb.org/t/p/w500/vP8tPOgmJSNOh4bpOv1bFjid3rZ.jpg','1981-06-25',6.5,0),(22536,'Dead Sexy','en','Meet Amber, Brandy and Cassie. These girls are about to encounter a paranormal force that is going to make them question the need for the opposite sex.','https://image.tmdb.org/t/p/w500/fPEgpDm5K7uFg9v84wE5nNmDZLW.jpg','2018-01-07',5.2,0),(22537,'Tom and Jerry: Shiver Me Whiskers','en','Dueling cat-and-mouse team Tom and Jerry hit the high seas on a hunt for buried treasure in this pirate adventure. The tale begins when crew member Tom sets sail with an infamous pirate and finds a treasure map along with stowaway Jerry. The furry swashbucklers race to a deserted island where X marks the spot, but along with battling each other, they must outwit ruthless buccaneers, angry monkeys and a giant octopus to strike it rich.','https://image.tmdb.org/t/p/w500/b964RtitRMbUSwTnv4qdbRzUwug.jpg','2006-08-21',6.8,0),(22538,'The Santa Clause 3: The Escape Clause','en','Now that Santa and Mrs. Claus have the North Pole running smoothly, the Counsel of Legendary Figures has called an emergency meeting on Christmas Eve! The evil Jack Frost has been making trouble, looking to take over the holiday! So he launches a plan to sabotage the toy factory and compel Scott to invoke the little-known Escape Clause and wish he\'d never become Santa.','https://image.tmdb.org/t/p/w500/pvaWMSRzRwtcxyHKNLX6phiQp8d.jpg','2006-11-02',5.5,0),(22539,'City Lights','en','In this sound-era silent film, a tramp falls in love with a beautiful blind flower seller.','https://image.tmdb.org/t/p/w500/bXNvzjULc9jrOVhGfjcc64uKZmZ.jpg','1931-02-01',8.3,0),(22540,'Shrek the Musical','en','Shrek The Musical is a musical with music by Jeanine Tesori and book and lyrics by David Lindsay-Abaire. It is based on the 2001 DreamWorks Animation\'s film Shrek and William Steig\'s 1990 book Shrek! It was nominated for 8 Tony Awards including Best Musical.','https://image.tmdb.org/t/p/w500/k3uIgE9obtdQnshufhzQlLKZW1Z.jpg','2013-09-17',7.3,0),(22541,'The Woman in Black 2: Angel of Death','en','40 years after the first haunting at Eel Marsh House, a group of children evacuated from WWII London arrive, awakening the house\'s darkest inhabitant.','https://image.tmdb.org/t/p/w500/9NcUFNCSzw4IFci3OhbX8ZyzoFn.jpg','2014-12-30',5.2,0),(22542,'The Little Vampire 3D','en','Tony, a thirteen-year-old boy on vacation in rural Germany, is fascinated by the idea of vampires. Meanwhile Rudolph, a vampire of \"similar\" age (313!), encounters trouble when his clan is threatened by a dangerously obsessed hunter. Fate brings these two boys together, as Tony & Rudolph set off an action-packed battle to stop the villain, save Rudolph\'s family and learn the power of friendship.','https://image.tmdb.org/t/p/w500/i9z2rBO4i5MhbvpEIxXZUoXSYUo.jpg','2017-10-04',6.1,0),(22543,'The Enforcer','en','Dirty Harry Callahan returns again, this time saddled with a rookie female partner. Together, they must stop a terrorist group consisting of angry Vietnam veterans.','https://image.tmdb.org/t/p/w500/l0W85fpnsfnpLSSF3D6bKKlH1dD.jpg','1976-12-20',6.8,0),(22544,'Still','th','A haunted house, a nightclub fire, a body found in a water tank, and a prison death make up four horror stories pulled from Thailand\'s newspaper headlines.','https://image.tmdb.org/t/p/w500/dliHBherBuDSmazI8iKPpmjo1Hd.jpg','2010-05-05',3.8,0),(22545,'The Other Side of the Door','en','Grieving over the loss of her son, a mother struggles with her feelings for her daughter and her husband. She seeks out a ritual that allows her say goodbye to her dead child, opening the veil between the world of the dead and the living. Her daughter becomes the focus of terror. She must now protect against the evil that was once her beloved son.','https://image.tmdb.org/t/p/w500/z5HubVaGLp1EXQbEXhg6hbEYee9.jpg','2016-02-25',5.5,0),(22546,'Escape from L.A.','en','This time, a cataclysmic temblor hits Los Angeles, turning it into an island. The president views the quake as a sign from above, expels Los Angeles from the country and makes it a penal colony for those found guilty of moral crimes. When his daughter, part of a resistance movement, steals the control unit for a doomsday weapon, Snake again gets tapped to save the day.','https://image.tmdb.org/t/p/w500/3L9lL2eUsmLNNfENPwNOc82Hzpw.jpg','1996-08-09',5.9,0),(22547,'Galaxy Quest','en','For four years, the courageous crew of the NSEA protector - \"Commander Peter Quincy Taggart\" (Tim Allen), \"Lt. Tawny Madison (Sigourney Weaver) and \"Dr.Lazarus\" (Alan Rickman) - set off on a thrilling and often dangerous mission in space...and then their series was cancelled! Now, twenty years later, aliens under attack have mistaken the Galaxy Quest television transmissions for \"historical documents\" and beam up the crew of has-been actors to save the universe. With no script, no director and no clue, the actors must turn in the performances of their lives.','https://image.tmdb.org/t/p/w500/fZXSwgZknp81vmciTb86rw0MejV.jpg','1999-12-25',7.1,0),(22548,'Ninja','en','A westerner named Casey, studying Ninjutsu in Japan, is asked by the Sensei to return to New York to protect the legendary Yoroi Bitsu, an armored chest that contains the weapons of the last Koga Ninja.','https://image.tmdb.org/t/p/w500/tKjH1IQVeUmHOlxZinQdjFHkFVG.jpg','2009-10-22',6,0),(22549,'Rugrats in Paris: The Movie','en','A group of rambunctious toddlers travel a trip to Paris. As they journey from the Eiffel Tower to Notre Dame, they learn new lessons about trust, loyalty and love.','https://image.tmdb.org/t/p/w500/2cmAmuptfvjaLtgynKwO0EU2urG.jpg','2000-11-17',6.6,0),(22550,'Hours','en','A father struggles to keep his infant daughter alive in the wake of Hurricane Katrina.','https://image.tmdb.org/t/p/w500/uN1A34fHZs7n1wBry45uRcHuVQs.jpg','2013-11-29',6.6,0),(22551,'Stargate: The Ark of Truth','en','SG-1 searches for an ancient weapon which could help them defeat the Ori, and discover it may be in the Ori\'s own home galaxy. As the Ori prepare to send ships through to the Milky Way to attack Earth, SG-1 travels to the Ori galaxy aboard the Odyssey. The International Oversight committee have their own plans and SG-1 finds themselves in a distant galaxy fighting two powerful enemies.','https://image.tmdb.org/t/p/w500/wsKsWoRxhCuw2dczg1rx9fUAhIp.jpg','2008-03-11',7.2,0),(22552,'Corsage','de','A fictional account of one year in the life of Empress Elisabeth of Austria. On Christmas Eve 1877, Elisabeth, once idolized for her beauty, turns 40 and is officially deemed an old woman; she starts trying to maintain her public image.','https://image.tmdb.org/t/p/w500/3G6XFxG8bfuL3r5dH9LRFXeV5z4.jpg','2022-07-07',6.9,0),(22553,'Disturbia','en','Kale is a 17-year-old placed under house arrest after punching his teacher. He is confined to his house, and decides to use his free time spying on his neighbors. Things start to get weird when guests enter the Turner\'s house and don\'t come back out. Kale and his friends, Ronnie and Ashley, start to grow more and more interested in what is actually happening within the house of Robert Turner.','https://image.tmdb.org/t/p/w500/bJNEBrDy6H4QMHj8GC9OHxPdwJm.jpg','2007-04-12',6.7,0),(22554,'2010','en','While planet Earth poises on the brink of nuclear self-destruction, a team of Russian and American scientists aboard the Leonov hurtles to a rendezvous with the still-orbiting Discovery spacecraft and its sole known survivor, the homicidal computer HAL.','https://image.tmdb.org/t/p/w500/mEWKXuCMv7mFMxXVSTI3v8UOQuq.jpg','1984-12-06',6.6,0),(22555,'Jay and Silent Bob Strike Back','en','When Jay and Silent Bob learn that their comic-book alter egos, Bluntman and Chronic, have been sold to Hollywood as part of a big-screen movie that leaves them out of any royalties, the pair travels to Tinseltown to sabotage the production.','https://image.tmdb.org/t/p/w500/aEsAdMAhwKYFgnHHxMOknktQYKK.jpg','2001-08-24',6.4,0),(22556,'Crocodile Dundee in Los Angeles','en','After settling in the tiny Australian town of Walkabout Creek with his significant other and his young son, Mick \"Crocodile\" Dundee is thrown for a loop when a prestigious Los Angeles newspaper offers his honey a job. The family migrates back to the United States, and Croc and son soon find themselves learning some lessons about American life -- many of them inadvertent','https://image.tmdb.org/t/p/w500/hwt6iJjPuXRDKJON5s9G9pdfPbu.jpg','2001-04-12',5.2,0),(22557,'The Second Wife','it','In the early 1960\'s, a Sicilian single mother marries an older, crass widowed truck driver. When he is arrested trying to smuggle an antique, she ends up falling in love with her handsome stepson.','https://image.tmdb.org/t/p/w500/gPZxppDzpFQj1wpwHEsXqI4qbM8.jpg','1998-11-05',5.3,0),(22558,'Needful Things','en','A mysterious new shop opens in a small town which always seems to stock the deepest desires of each shopper, with a price far heavier than expected.','https://image.tmdb.org/t/p/w500/rRgMT4SZIASteKev1R6i7VqoUHf.jpg','1993-08-27',6.2,0),(22559,'The Equalizer 3','en','Third film in The Equalizer franchise.','https://image.tmdb.org/t/p/w500/BYN6RSv6MRiIDEYtTcgIngyDln.jpg','2023-08-30',0,0),(22560,'House','en','Roger Cobb is an author who has just separated from his wife. He moves into a new house and tries to work on a novel based on his experiences in the Vietnam War. Strange things start happening around him; little things at first, but as they become more frequent, Cobb becomes aware that the house resents his presence.','https://image.tmdb.org/t/p/w500/ysIPmxLVYYvTUaOwEsLjF7nEf4C.jpg','1986-02-27',6.1,0),(22561,'Brimstone','en','In the menacing inferno of the old North-American West, Liz is a genuine survivor who is hunted by a vengeful preacher for a crime she didn’t commit.','https://image.tmdb.org/t/p/w500/aNxU4eZrfiChOgCEtyKWSCExdEi.jpg','2016-03-12',7.1,0),(22562,'Bean','en','Childlike Englishman, Mr. Bean, is an incompetent watchman at the Royal National Gallery. After the museum\'s board of directors\' attempt to have him fired is blocked by the chairman, who has taken a liking to Bean, they send him to Los Angeles to act as their ambassador for the unveiling of a historic painting to humiliate him. Fooled, Mr. Bean must now successfully unveil the painting or risk his and a hapless Los Angeles curator\'s termination.','https://image.tmdb.org/t/p/w500/IwrDPrB4d2DMcpnGkvan46yINL.jpg','1997-07-03',6.5,0),(22563,'A Street Cat Named Bob','en','James Bowen, a homeless busker and recovering drug addict, has his life transformed when he meets a stray ginger cat.','https://image.tmdb.org/t/p/w500/nBYG0D2FcbL1m926sIj7RN4m0sb.jpg','2016-11-04',7.9,0),(22564,'Iron Man & Captain America: Heroes United','en','Iron Man and Captain America battle to keep the Red Skull and his triggerman, Taskmaster, from unleashing an army of Hydra Brutes on the world!  Sequel to the film \"Iron Man & Hulk: Heroes United\" and feature Iron Man teaming up with Captain America, it comes to accompany the live-action film \"Captain America: The Winter Soldier\".','https://image.tmdb.org/t/p/w500/CX7eRlaxFXiW3UGQBdQUoSVZRi.jpg','2014-07-29',6.3,0),(22565,'Your Friend the Rat','en','Let\'s face it, rats are not the most beloved creatures on earth. However, maybe this little tale about the history of human and rat interaction will change the world\'s tune. At least that is the hope of Remy, the star of Ratatouille, and his reluctant brother Emile as they guide us through world history from a rat\'s perspective. Why can\'t we all just get along?','https://image.tmdb.org/t/p/w500/a61VT01BuR6WEKB9HGiRgNZm29l.jpg','2007-11-06',6.7,0),(22566,'Courage Under Fire','en','A US Army officer, who made a \"friendly fire\" mistake that was covered up, has been reassigned to a desk job. He is tasked to investigate a female chopper commander\'s worthiness to be awarded the Medal of Honor. At first all seems in order. But then he begins to notice inconsistencies between the testimonies of the witnesses...','https://image.tmdb.org/t/p/w500/vDJurMJkrx049AiXa3DJx5Zx7a4.jpg','1996-07-04',6.5,0),(22567,'Fallen','en','Lucinda Price is sent to a reform academy under the assumption that she has killed a boy. There, she meets two mysterious boys, Cam and Daniel, to whom she feels drawn to both. But as the love triangle unfurls, it is Daniel that Luce cannot keep herself away from, and things begin to take a darker turn when she finds out his true identity.','https://image.tmdb.org/t/p/w500/k0na2JR3mIgl5m64tW5uxB5Fa4m.jpg','2016-11-10',6.1,0),(22568,'Valiant','en','Set in 1944, Valiant is a woodland pigeon who wants to become a great hero someday. When he hears they are hiring recruits for the Royal Homing Pigeon Service, he immediately sets out for London. On the way, he meets a smelly but friendly pigeon named Bugsy, who joins him, mainly to get away from clients he cheated in a game of find-the pebble, and helps him sign up for the war.','https://image.tmdb.org/t/p/w500/chtAKvXb897I2Pn8HOkV4TC5Jzz.jpg','2005-03-25',5.5,0),(22569,'Viking','ru','The early Middle Ages. A time of heavy swords and dark blood law. The ruling clan is in discord. The guilt for the accidental death of the brother has fallen on the Grand Duke. According to the law, revenge must be taken by the younger brother, a bastard. For the refusal to kill, he has to pay with eve- rything he had, because “for peace you need more swords than for a war”...','https://image.tmdb.org/t/p/w500/xxl0YHkYHHCetgnG2fgezUaQiHc.jpg','2016-12-29',4.8,0),(22570,'The Banana Splits Movie','en','A boy named Harley and his family attend a taping of The Banana Splits TV show, which is supposed to be a fun-filled birthday for young Harley and business as usual for Rebecca, the producer of the series. But things take an unexpected turn - and the body count quickly rises. Can Harley, his mom and their new pals safely escape?','https://image.tmdb.org/t/p/w500/vG9FY2wHVwOOQfqNlUt2LbRzRNl.jpg','2019-09-04',6.7,0),(22571,'Out of the Furnace','en','Two brothers live in the economically-depressed Rust Belt, when a cruel twist of fate lands one in prison. His brother is then lured into one of the most violent crime rings in the Northeast.','https://image.tmdb.org/t/p/w500/cOuQQ4eRpSBxb0G9OXzWE1pHPeq.jpg','2013-12-06',6.6,0),(22572,'Heartbreak Ridge','en','A hard-nosed, hard-living Marine gunnery sergeant clashes with his superiors and his ex-wife as he takes command of a spoiled recon platoon with a bad attitude.','https://image.tmdb.org/t/p/w500/aMr99UigkMCTSPnLTpkzJeLmpyc.jpg','1986-12-05',6.8,0),(22573,'Bill & Ted\'s Excellent Adventure','en','Bill and Ted are high school buddies starting a band. They are also about to fail their history class—which means Ted would be sent to military school—but receive help from Rufus, a traveller from a future where their band is the foundation for a perfect society. With the use of Rufus\' time machine, Bill and Ted travel to various points in history, returning with important figures to help them complete their final history presentation.','https://image.tmdb.org/t/p/w500/tV25lGWGWGEqUe3U0xjQTBgilSx.jpg','1989-02-17',6.9,0),(22574,'Day of Reckoning','en','Some years ago, the world experienced a \"day of reckoning\" when creatures came up from below and purged humanity of evil. Now, it is happening again.','https://image.tmdb.org/t/p/w500/lQOrFfaFTtSSmOtDCSM2EzHguOq.jpg','2017-05-18',4.4,0),(22575,'Arctic Blast','en','When a solar eclipse sends a colossal blast of super chilled air towards the earth, it then sets off a catastrophic chain of events that threatens to engulf the world in ice and begin a new Ice Age.','https://image.tmdb.org/t/p/w500/54JrDQq3ISxwTAHz0yfbFNhBC7f.jpg','2010-08-04',5.5,0),(22576,'Prisoners of the Ghostland','en','In the treacherous frontier city of Samurai Town, a ruthless bank robber is sprung from jail by wealthy warlord The Governor, whose adopted granddaughter Bernice has gone missing. The Governor offers the prisoner his freedom in exchange for retrieving the runaway. Strapped into a leather suit that will self-destruct within five days, the bandit sets off on a journey to find the young woman—and his own path to redemption.','https://image.tmdb.org/t/p/w500/j5HRzcvN1QXZLvwfc3NLxX8XQJY.jpg','2021-08-31',5.2,0),(22577,'Initiation','en','During a Whiton University\'s pledge week, the carefree partying turns deadly when brutal murders start befalling the students, sending Ellery into a race against time to uncover the truth behind the school\'s dark secrets and the horrifying meaning of a recurring symbol: a single exclamation mark.','https://image.tmdb.org/t/p/w500/oT3q1gClsLyDS6kI15FYISy4arw.jpg','2020-10-08',5.5,0),(22578,'Miss Bala','en','Gloria finds a power she never knew she had when she is drawn into a dangerous world of cross-border crime. Surviving will require all of her cunning, inventiveness, and strength.','https://image.tmdb.org/t/p/w500/ae9yrSAS7nLZPbbkOm61pSuIqeo.jpg','2019-02-01',6.4,0),(22579,'The Five Devils','fr','Vicky lives with her mother Joanne and father Jimmie, a man struggling to find his place. When Vicky\'s aunt Julia arrives after being released from prison, her presence brings back the past in a violent, magical way.','https://image.tmdb.org/t/p/w500/1G7HdGFF5jeQplwYPpIDHou8vZm.jpg','2022-08-31',7.2,0),(22580,'Wendy Wu: Homecoming Warrior','en','It is the story of an average, popular American teenager named Wendy Wu who discovers that in order to win the coveted crown she must first learn the way of the warrior. Wendy Wu has a one track mind, and that track leads directly to the title of homecoming queen -- no unscheduled stops, and no unnecessary detours. When a mysterious Chinese monk named Shen arrives to mold Wendy into a fearless kung fu warrior, however, her royal aspirations suddenly jump the track as she desperately attempts to juggle her boyfriend, her homework, and of course, the fierce competition to become homecoming queen. Now, as Wendy begins to train her mind, body, and spirit in the ancient tradition of the martial arts and her inner warrior gradually begins to emerge, the girl who once obsessed over popularity finally begins to put that popularity into perspective as she gradually realizes what truly matters in life.','https://image.tmdb.org/t/p/w500/70i9WopFTHmTJbKbKQGdYWBHnj6.jpg','2006-06-16',6.2,0),(22581,'Hey Arnold! The Movie','en','Arnold and his friends must recover a stolen document in order to prevent the neighborhood from being bulldozed.','https://image.tmdb.org/t/p/w500/etxcq4qiFNi5p0q71APw8MNzPPT.jpg','2002-06-28',6.5,0),(22582,'The Avengers','en','British Ministry agent John Steed, under direction from \"Mother\", investigates a diabolical plot by arch-villain Sir August de Wynter to rule the world with his weather control machine. Steed investigates the beautiful Doctor Mrs. Emma Peel, the only suspect, but simultaneously falls for her and joins forces with her to combat Sir August.','https://image.tmdb.org/t/p/w500/1p5thyQ4pCy876HpdvFARqJ62N9.jpg','1998-08-13',4.4,0),(22583,'The Jackal','en','Hired by a powerful member of the Russian mafia to avenge an FBI sting that left his brother dead, a psychopathic hitman known only as The Jackal proves an elusive target for the people charged with the task of bringing him down: a deputy FBI director, a Russian MVK Major,  and a jailed IRA terrorist who can recognize him.','https://image.tmdb.org/t/p/w500/wkLF73oenC1n1DDKKU7oyLKVcMa.jpg','1997-11-14',6.3,0),(22584,'All the Devil\'s Men','en','A battle-scarred War on Terror bounty hunter is forced to go to London on a manhunt for a disavowed CIA operative, which leads him into a deadly running battle with a former military comrade and his private army.','https://image.tmdb.org/t/p/w500/pBv6fq7q9rNE8munZwUTIb5HbCS.jpg','2018-05-12',5.9,0),(22585,'Blown Away','en','Blown Away tells the story of Jimmy Dove who works for the Boston bomb squad. Shortly after Dove leaves the force his partner is killed by a bomb that Dove thinks might have been made by someone he knows.','https://image.tmdb.org/t/p/w500/lszv2OiImvhzcTtfxDaNiHhTK7J.jpg','1994-07-01',6.1,0),(22586,'Pitch Black','en','When their ship crash-lands on a remote planet, the marooned passengers soon learn that escaped convict Riddick isn\'t the only thing they have to fear. Deadly creatures lurk in the shadows, waiting to attack in the dark, and the planet is rapidly plunging into the utter blackness of a total eclipse. With the body count rising, the doomed survivors are forced to turn to Riddick with his eerie eyes to guide them through the darkness to safety. With time running out, there\'s only one rule: Stay in the light.','https://image.tmdb.org/t/p/w500/3AnlxZ5CZnhKKzjgFyY6EHxmOyl.jpg','2000-02-18',6.8,0),(22587,'Jope – Just Think for Yourself','fi','An overweight boy who was a bullied at school grew up to become a beloved comedian, folk artist Jope Ruonansuu. He was a versatile entertainer, but above all an impressionist, able to imitate more than 150 characters from the ruling class. Jope\'s journey was a natural extension of the post-war \"Rillumarei\" -culture. He broke through when the monoculturalism was at its most vibrant and grew in popularity as it began to crumble. With weight loss surgery, Jope sought a healthier life, but also to shed the extra pounds and childhood traumas. After the surgery, he was diagnosed with oesophageal cancer, but continued to fight, developing a number of different projects, including an anti-bullying campaign together with the President of Finland, Sauli Niinistö. The project was to culminate in a joint visit to Syväkangas school, in Jope\'s home town of Kemi. Jope passed away before then, but Niinistö kept his promise.','https://image.tmdb.org/t/p/w500/ipE9NQrJHibWAgWVbJbX0WfyxKq.jpg','2023-02-10',0,0),(22588,'The Map of Tiny Perfect Things','en','The story of two teenagers trapped in an endless time loop who set out to find all the tiny things that make that one day perfect.','https://image.tmdb.org/t/p/w500/6y3ev0rJFbHA1hU22UPmmfzBjrG.jpg','2021-02-12',7.2,0),(22589,'Maximum Overdrive','en','When a comet passes close to the earth, machines all over the world come alive and go on homicidal rampages. A group of people at a desolate truck stop are held hostage by a gang of homicidal 18-wheelers. The frightened people set out to defeat the killer machines ... or be killed by them.','https://image.tmdb.org/t/p/w500/sUC3o1BWQ8QhrwZcDj7x2VsWjtG.jpg','1986-07-25',5.8,0),(22590,'La leyenda del Charro Negro','es','After releasing the Chupacabras, Leo San Juan decides that it is time to return together with his brother Nando to his grandmother\'s house. Halfway down the road, Charro Negro manages to confuse Leo and because of him, an innocent girl is dragged into the underworld. Leo is forced to repair the damage. Your friends will come to try to help you and get out of there as soon as possible. But it is no coincidence that the Charro has chosen to involve Leo, his intentions go beyond getting a new soul.','https://image.tmdb.org/t/p/w500/fDLJ5vIeRL68cIHlob11w2pBzH0.jpg','2018-01-19',8,0),(22591,'Falcon Rising','en','Chapman is an ex-marine in Brazil\'s slums, battling the yakuza outfit who attacked his sister and left her for dead.','https://image.tmdb.org/t/p/w500/4wnfTO8mvqcTU62YMkUeKq49VMT.jpg','2014-09-05',6.2,0),(22592,'The Nut Job','en','Surly, a curmudgeon, independent squirrel is banished from his park and forced to survive in the city. Lucky for him, he stumbles on the one thing that may be able to save his life, and the rest of park community, as they gear up for winter - Maury\'s Nut Store.','https://image.tmdb.org/t/p/w500/4iHnGlmOjAj2k5zUftYDIzSITCf.jpg','2014-01-17',5.8,0),(22593,'Serpico','en','Frank Serpico is an idealistic New York City cop who refuses to take bribes, unlike the rest of the force. His actions get Frank shunned by the other officers, and often placed in dangerous situations by his partners. When his superiors ignore Frank\'s accusations of corruption, he decides to go public with the allegations. Although this causes the Knapp Commission to investigate his claims, Frank has also placed a target on himself.','https://image.tmdb.org/t/p/w500/76rLcn53Fjdh4Dji9EIeJ98aYj1.jpg','1973-12-18',7.5,0),(22594,'Sherlock Gnomes','en','Garden gnomes, Gnomeo & Juliet, recruit renown detective, Sherlock Gnomes, to investigate the mysterious disappearance of other garden ornaments.','https://image.tmdb.org/t/p/w500/wqnzpJR3PwS4doVkAkt9seSEpoX.jpg','2018-03-15',5.6,0),(22595,'The Extraordinary Adventures of Adèle Blanc-Sec','fr','An adventure set in the early part of the 20th century, focused on a popular novelist and her dealings with would-be suitors, the cops, monsters, and other distractions.','https://image.tmdb.org/t/p/w500/1nYv7H0XJFgrJ5LewGlyNDvjqdq.jpg','2010-04-09',6.1,0),(22596,'Hellraiser: Inferno','en','A shady police detective becomes embroiled in a strange world 