in, Bastian is transported to the world of Fantasia which he recently managed to save from destruction. However, the land is now being destroyed by an evil sorceress, Xayide, so he must join up with Atreyu and face the Emptiness once more.','https://image.tmdb.org/t/p/w500/5QfUCbgKzWzjHO5X4ANsDmuTxNQ.jpg','1990-10-24',5.7,0),(22623,'Halloween H20: 20 Years Later','en','Two decades after surviving a massacre on October 31, 1978, former baby sitter Laurie Strode finds herself hunted by persistent knife-wielder Michael Myers. Laurie now lives in Northern California under an assumed name, where she works as the headmistress of a private school. But it\'s not far enough to escape Myers, who soon discovers her whereabouts. As Halloween descends upon Laurie\'s peaceful community, a feeling of dread weighs upon her -- with good reason.','https://image.tmdb.org/t/p/w500/lqLXUm3oK59sGJKRH2Zjj2m3iMg.jpg','1998-08-05',6,0),(22624,'Buddy Games','en','After six lifelong friends have a five-year falling out, “The Bobfather”, reunites his pals for the Buddy Games, an insane competition of absurd physical and mental challenges with the chance to win a $150,000 pot. Now all bets are off, as the determined dudes\' fight, claw, and party for the big bucks.','https://image.tmdb.org/t/p/w500/uNCZh6YGg6r0GMyrctI14R0lHGL.jpg','2019-11-18',5.3,0),(22625,'Monster\'s Ball','en','Set in the southern USA, a racist white man, Hank, falls in love with a black woman named Leticia. Ironically, Hank is a prison guard working on Death Row who executed Leticia\'s husband. Hank and Leticia\'s inter-racial affair leads to confusion and new ideas for the two unlikely lovers.','https://image.tmdb.org/t/p/w500/rPhs7Mw4ql2CotjxDCwUs5PBPxo.jpg','2001-06-07',6.8,0),(22626,'Mortadelo and Filemon: Mission Implausible','es','A criminal produces an uncontrollable laughter to the population and Mortadelo and Filemón will have to stop him.','https://image.tmdb.org/t/p/w500/sPe5NAeegRoRTkngYfZgANppNN.jpg','2014-08-30',6.6,0),(22627,'12 Rounds','en','When New Orleans Police Detective Danny Fisher stops a brilliant thief from getting away with a multimillion-dollar heist, the thief\'s girlfriend is accidentally killed. After escaping from prison, the criminal mastermind enacts his revenge, taunting Danny with 12 rounds of near-impossible puzzles and tasks that he must somehow complete to save the life of the woman he loves.','https://image.tmdb.org/t/p/w500/7k7qhrO57sVoBLrNo5HYoTp24sT.jpg','2009-03-19',5.9,0),(22628,'Still Out of My League','it','After breaking up with her dreamboat, Marta finds love with an artist. But life throws a few twists into the mix for the ailing woman and her friends.','https://image.tmdb.org/t/p/w500/soVwWSesTguGQSNsEpdSr46z98M.jpg','2021-09-16',6.6,0),(22629,'Abraham Lincoln vs. Zombies','en','As Abraham Lincoln labors over the Gettysburg address, the importance of which he is fully aware, he learns that a menace from his past has returned, threatening to tear the already fractured nation to pieces. He must journey behind enemy lines to face an foe far more fearsome than the Confederate army: the walking dead.','https://image.tmdb.org/t/p/w500/kcrZQxlzyCepVGqvWvWSm67JFhL.jpg','2012-05-29',4,0),(22630,'The Do-Over','en','The life of a bank manager is turned upside down when a friend from his past manipulates him into faking his own death and taking off on an adventure.','https://image.tmdb.org/t/p/w500/z9VCm2E6gCAwbM2SELRawfqdXBO.jpg','2016-05-27',5.7,0),(22631,'The Talented Mr. Ripley','en','Tom Ripley is a calculating young man who believes it\'s better to be a fake somebody than a real nobody. Opportunity knocks in the form of a wealthy U.S. shipbuilder who hires Tom to travel to Italy to bring back his playboy son, Dickie. Ripley worms his way into the idyllic lives of Dickie and his girlfriend, plunging into a daring scheme of duplicity, lies and murder.','https://image.tmdb.org/t/p/w500/6ojHgqtIR41O2qLKa7LFUVj0cZa.jpg','1999-12-25',7.2,0),(22632