 traditions.','https://image.tmdb.org/t/p/w500/tcRaMjWoF8K7h1LqOH7FOOLRQ3e.jpg','1997-02-14',6.4,0),(22637,'The Haunting','en','Dr. David Marrow invites three distinct individuals to the eerie and isolated Hill House to be subjects for a sleep disorder study. The unfortunate guests discover that Marrow is far more interested in the sinister mansion itself — and they soon see the true nature of its horror.','https://image.tmdb.org/t/p/w500/dU07NZikdFAA5cK63yyHfy07uS4.jpg','1999-07-23',5.4,0),(22638,'Siberia','en','Lucas, a diamond trader who travels to Saint Petersburg to arrange a sale, discovers that his Russian business partner has left his hotel and gone to a small Siberian village, so Lucas also heads there to try find him.','https://image.tmdb.org/t/p/w500/eGfIsvdrUhTlQOkxQIELU7obDYj.jpg','2018-07-13',4.8,0),(22639,'Like Mike','en','Calvin and his friends, who all live in an orphanage, find old shoes with the faded letters MJ connected to a powerline. One stormy night, they go to get the shoes when Calvin and the shoes are struck by lightning. Calvin now has unbelievable basketball powers and has the chance to play for the NBA.','https://image.tmdb.org/t/p/w500/ruuj6Yz9Vvyk6MI0ejRmAcnT8V5.jpg','2002-07-03',6.1,0),(22640,'Eurovision Song Contest: The Story of Fire Saga','en','Two small-town aspiring musicians chase their pop star dreams at a global music competition, where high stakes, scheming rivals and onstage mishaps test their bond.','https://image.tmdb.org/t/p/w500/9zrbgYyFvwH8sy5mv9eT25xsAzL.jpg','2020-06-26',6.4,0),(22641,'A Very Harold & Kumar Christmas','en','Six years have elapsed since Guantanamo Bay, leaving Harold and Kumar estranged from one another with very different families, friends and lives. But when Kumar arrives on Harold\'s doorstep during the holiday season with a mysterious package in hand, he inadvertently burns down Harold\'s father-in-law\'s beloved Christmas tree. To fix the problem, Harold and Kumar embark on a mission through New 