. Lara must recover the box before evil mastermind Reiss uses it to construct a weapon of catastrophic capabilities.','https://image.tmdb.org/t/p/w500/ylIEGeAr2ygSClK4FDj9mi2Ah22.jpg','2003-07-21',5.7,0),(22647,'New York Minute','en','Top student Jane Ryan heads to Manhattan for a college-scholarship competition. Her rebellious twin Roxy Ryan goes along to crash a video shoot. But anything can happen - and does - in a romp involving a pursuing truant officer, a smuggler, hunkalicious guys and the girls\' realization that when the chips are down, a sister can be the best friend of all.','https://image.tmdb.org/t/p/w500/ikvhT12oArMyJO3dpNwX2n3rFPR.jpg','2004-05-07',6.2,0),(22648,'Tom and Jerry Blast Off to Mars!','en','While carrying on their usual hi-jinks, they inadvertantly stow-away on a spaceship bound for Mars. They meet up with the local Martian residents and cause them to invade the Earth, aided by the \"Invincitron\", a vacuum-wielding giant robot. Tom, Jerry and their Martian ally, Peep, save the day.','https://image.tmdb.org/t/p/w500/oxVDcmStxKn4ChxdzfuCOLZiE9W.jpg','2005-01-18',6.6,0),(22649,'The House of Flowers: The Movie','es','The De La Mora siblings concoct a mischievous plan to break into their old family home to retrieve a hidden treasure of significant importance.','https://image.tmdb.org/t/p/w500/nzbwTwSo8aKuvAytaPG6s0xGVE8.jpg','2021-06-23',8.1,0),(22650,'Laura y el misterio del asesino inesperado','es','After years of leave, Laura Lebrel returns to action. Lydia asks him for help on a case: Eugenio Ortiz, Laura\'s former instructor, has been murdered. But a new detective, Hector, finds evidence that incriminates Laura. She asks to be allowed to find the killer and Lydia gives her 24 hours to solve the case before arresting her.','https://image.tmdb.org/t/p/w500/p6T9g5a227cUs4rlTlaxo8QAqIf.jpg','2022-01-13',6.9,0),(22651,'Jackass: The Movie','en','Johnny Knoxville and his band of maniacs perform a variety of stunts and gross-out gags on the big screen for the first time. They wander around Japan in panda outfits, wreak havoc on a once civilized golf course, they even do stunts involving LIVE alligators, and so on.','https://image.tmdb.org/t/p/w500/9Rb659hvGfmef1xm0mMvDHEBqmf.jpg','2002-10-25',6.3,0),(22652,'Belle\'s Magical World','en','Belle, the Beast, Lumiere, Cogsworth and the rest of those zany castle residents use their imaginations to embark on three magical, storybook adventures. This direct-to-video anthology serves as a \"sequel\" to Disney\'s animated hit film. In \"The Perfect World,\" Belle and the Beast learn about forgiveness. In \"Fifi\'s Folly,\" Lumiere\'s girlfriend is jealous of his bond with Belle. And in \"Broken Wing,\" the Beast learns to be kind to an injured bird.','https://image.tmdb.org/t/p/w500/lq5LnHRxjGw0HlQ6inMdmDdzEE.jpg','1998-02-16',6.2,0),(22653,'Daylight','en','A group of armed robbers fleeing the police head for the New Jersey Tunnel and run right into trucks transporting toxic waste. The spectacular explosion that follows results in both ends of the tunnel collapsing and the handful of people who survived the explosion are now in peril. Kit Latura is the only man with the skill and knowledge to lead the band of survivors out of the tunnel before the structure collapses.','https://image.tmdb.org/t/p/w500/omw7K0L6qArF87zv7qDjjVysyev.jpg','1996-12-06',6.1,0),(22654,'Shinjuku Incident','cn','Steelhead is a Chinese labourer who comes to Japan hoping for a better life. Unable to find honest work and bullied into the shadows with his fellow Chinese illegal immigrants, he soon finds himself ascending as the boss of a black market mob. After providing a deadly service to a powerful Yakuza crime boss, Steelhead’s rise to mafia power spirals rapidly out of control as he’s given reign over the dangerous and lucrative Shinjuku district.','https://image.tmdb.org/t/p/w500/8zWliijoTsk3kUdUJpbjqWgV617.jpg','2009-03-22',6.6,0),(22655,'Escape Room','en','Six friends test their intelligence in a game that takes a dark turn.','https://image.tmdb.org/t/p/w500/bq3wmW5ZJsnOHM6NLGsjDvX7CxB.jpg','2017-09-14',4.5,0),(22656,'Lincoln','en','The revealing story of the 16th US President\'s tumultuous final months in office. In a nation divided by war and the strong winds of change, Lincoln pursues a course of action designed to end the war, unite the country and abolish slavery. With the moral courage and fierce determination to succeed, his choices during this critical moment will change the fate of generations to come.','https://image.tmdb.org/t/p/w500/oOo905cttAIkHERDBya5sX6HbIV.jpg','2012-11-09',6.9,0),(22657,'Puppylove','fr','Diane is a mysterious and lonely teenager. Sharing special bonds with her father Christian, she takes care of the education of her brother Marc. The arrival of Julia in the neighborhood, a charismatic and liberated young British woman, is going to disturb Diane’s daily life.  Desperately willing to become an adult, Diane is going to live, for a semester, the most shattering experiences of her life. The more she gets close to Julia, the more she gets irresponsible, ignoring consequences and limits to her desires.','https://image.tmdb.org/t/p/w500/pTiwGVsU3j3X0KSgsfw9hPu5pCB.jpg','2013-06-29',5.9,0),(22658,'Bill & Ted Face the Music','en','Yet to fulfil their rock and roll destiny, the now middle-aged best friends Bill and Ted set out on a new adventure when a visitor from the future warns them that only their song can save life as we know it. Along the way, they are helped by their daughters, a new batch of historical figures and a few music legends — to seek the song that will set their world right and bring harmony to the universe.','https://image.tmdb.org/t/p/w500/4V2nTPfeB59TcqJcUfQ9ziTi7VN.jpg','2020-08-27',5.9,0),(22659,'The Place Beyond the Pines','en','A motorcycle stunt rider considers committing a crime in order to provide for his wife and child, an act that puts him on a collision course with a cop-turned-politician.','https://image.tmdb.org/t/p/w500/d5YPKAHJYmfGBaDMGV6xE8wfsoa.jpg','2013-03-14',7,0),(22660,'Dead Man Walking','en','A death row inmate turns for spiritual guidance to a local nun in the days leading up to his scheduled execution for the murders of a young couple.','https://image.tmdb.org/t/p/w500/wQmmJi5ypfHH2boXrQBmsep7qb2.jpg','1995-12-29',7.4,0),(22661,'Toys of Terror','en','A big family moves into a dusty old house in the snowy woods of Washington with hopes of it being a nice holiday escape. But the kids soon discover a stash of old toys that just so happen to belong to a creepy ghost boy. As stranger and stranger things start to happen, some of the kids begin to sense that something in the house is not quite right…','https://image.tmdb.org/t/p/w500/c6hmAgPVXxZHwMHfS9z3W2n9Gz9.jpg','2021-12-02',6,0),(22662,'Fathers and Daughters','en','A Pulitzer-winning writer grapples with being a widower and father after a mental breakdown, while, 27 years later, his grown daughter struggles to forge connections of her own.','https://image.tmdb.org/t/p/w500/fgzp7gGea27hN5d26mgKtZJQgX7.jpg','2015-10-01',7.1,0),(22663,'Jonah and the Pink Whale','es','Bolivia\'s submission for the Academy Award for Best Foreign Language Film in 1995','https://image.tmdb.org/t/p/w500/o2NM1C3whb5nslgLObmqLjNw0si.jpg','1995-11-07',5.2,0),(22664,'Bank of Dave','en','The true story of how Dave Fishwick, a working class man and self-made millionaire, fought to set up a community bank so that he could help the local businesses of Burnley not only survive, but thrive. In his bid to help his beloved community, he has to take on the elitist financial institutions of London and fight to receive the first, new banking license to be issued in over 100 years.','https://image.tmdb.org/t/p/w500/7aV4bFGMDFPUZHPnDkZyxSoJmG7.jpg','2023-01-16',7.2,0),(22665,'2046','zh','Women enter and exit a science fiction author\'s life over the course of a few years after the author loses the woman he considers his one true love.',