uardian','en','A high school swim champion with a troubled past enrolls in the U.S. Coast Guard\'s \'A\' School, where legendary rescue swimmer, Ben Randall teaches him some hard lessons about loss, love, and self-sacrifice.','https://image.tmdb.org/t/p/w500/iFOw9bXeLM6a2WbI7T1ytF8o0Wn.jpg','2006-09-28',7.1,0),(22672,'A Most Violent Year','en','A thriller set in New York City during the winter of 1981, statistically one of the most violent years in the city\'s history, and centered on the lives of an immigrant and his family trying to expand their business and capitalize on opportunities as the rampant violence, decay, and corruption of the day drag them in and threaten to destroy all they have built.','https://image.tmdb.org/t/p/w500/861WY0triAjO0A6VWMhrZ6s7VFG.jpg','2014-12-31',6.6,0),(22673,'Big Game','en','Air Force One is shot down by terrorists, leaving the President of the United States stranded in the wilderness. 13-year old Oskari is also in that wilderness, on a hunting mission to prove his maturity to his kinsfolk by tracking down a deer, but instead discovers the President in an escape pod. With the terrorists closing in to capture their prize, the unlikely duo team up to escape their hunters.','https://image.tmdb.org/t/p/w500/eWFH7P8A9t8Bg6MkLPYmvS4t6di.jpg','2014-09-05',5.5,0),(22674,'Secretariat','en','Housewife and mother Penny Chenery agrees to take over her ailing father\'s Virginia-based Meadow Stables, despite her lack of horse-racing knowledge. Against all odds, Chenery - with the help of veteran trainer Lucien Laurin - manages to navigate the male-dominated business, ultimately fostering the first Triple Crown winner in 25 years.','https://image.tmdb.org/t/p/w500/9bpAR3ALEfaqosxbi9zpuv9FH7F.jpg','2010-08-20',7.4,0),(22675,'The Dyatlov Pass Incident','en','In February of 1959, nine Russian hikers ventured into a remote area of the Ural Mountains. Two weeks later, all of them were found dead. What happened is a mystery that has baffled investigators and researchers for decades. It has become known as the Dyatlov Pass Incident.  When five ambitious American college students are issued a grant to return to the site of the original events, they gear up with the belief that they can uncover and document the truth of what happened to the supposedly experienced hikers. But what they find is more shocking than anything they could have imagined. Retracing the steps of the Russians\' ill-fated journey, the students are plagued by strange and increasingly terrifying phenomena that suggest that in spite of the desolate surroundings, they are not alone. The forces at work in the Dyatlov Pass Incident have been waiting for them.','https://image.tmdb.org/t/p/w500/8hyvniwVeSvKbTNKrY44ndMsQht.jpg','2013-02-27',5.9,0),(22676,'All Dogs Go to Heaven 2','en','Charlie and Itchy return to Earth to find Gabriel\'s Horn, but along the way meet up with a young boy named David, who ran away from home.','https://image.tmdb.org/t/p/w500/qsansaFyxL2airYMVxpTWmsLuml.jpg','1996-03-29',5.9,0),(22677,'First Daughter','en','Samantha MacKenzie, the daughter of the president of the United States, arrives at college with a group of Secret Service agents. Samantha, however, resents their presence and decides she wants to attend school just like a normal student. Her father agrees to recall the agents but secretly assigns James, an undercover agent, to pose as a student. They fall in love, but their romance is jeopardized when Samantha learns James\' true identity.','https://image.tmdb.org/t/p/w500/iUZ3hDMo8SGY2IoujCKwVt8ukm9.jpg','2004-09-24',6.1,0),(22678,'50/50','en','Inspired by a true story, a comedy centered on a 27-year-old guy who learns of his cancer diagnosis and his subsequent struggle to beat the disease.','https://image.tmdb.org/t/p/w500/8f9tM9JVB4ETBhxlQcXIjLckArl.jpg','2011-09-30',7.1,0),(22679,'Living','en','In 1950s London, a humorless civil servant decides to take time off work to experience life after receiving a grim diagnosis.','https://image.tmdb.org/t/p/w500/zUJcp0rpUqp2GSk7t9jvAiZsXtM.jpg','2022-11-04',7.3,0),(22680,'Lego DC Comics Super Heroes: The Flash','en','Reverse-Flash manipulates the Speed Force to put the Flash into a time loop that forces him to relive the same day over and over again—with progressively disastrous results, including losing his powers and being fired by the Justice League. The Flash must find a way to restore time to its original path and finally apprehend his worst enemy before all is lost for the Flash…and the world!','https://image.tmdb.org/t/p/w500/u27j3CiMEtNdDRleYwnruQ5Ktkm.jpg','2018-02-13',6.9,0),(22681,'The High Note','en','Set in the dazzling world of the LA music scene comes the story of Grace Davis, a superstar whose talent, and ego, have reached unbelievable heights. Maggie is Grace’s overworked personal assistant who’s stuck running errands, but still aspires to her childhood dream of becoming a music producer. When Grace’s manager presents her with a choice that could alter the course of her career, Maggie and Grace come up with a plan that could change their lives forever.','https://image.tmdb.org/t/p/w500/yHsu8swJSgqDrsPiu7adBjOPLlp.jpg','2020-06-10',7.1,0),(22682,'Yours, Mine & Ours','en','Admiral Frank Beardsley returns to New London to run the Coast Guard Academy, his last stop before a probable promotion to head the Guard. A widower with eight children, he runs a loving but tight ship, with charts and salutes. The kids long for a permanent home. Helen North is a free spirit, a designer whose ten children live in loving chaos, with occasional group hugs. Helen and Frank, high school sweethearts, reconnect at a reunion, and it\'s love at first re-sighting. They marry on the spot. Then the problems start as two sets of kids, the free spirits and the disciplined preppies, must live together. The warring factions agree to work together to end the marriage.','https://image.tmdb.org/t/p/w500/1SfsoUYXRRrfL31br8q4DlTYvKK.jpg','2005-11-23',6.1,0)