ty.','https://image.tmdb.org/t/p/w500/67ZsRKbItt6B1yHlsJKgfPWOyuJ.jpg','2022-11-03',5.9,0),(22695,'Real Genius','en','Chris is the top brain who just wants to party, Mitch is the 15-year-old college wiz kid. Supposedly hard at work on a lab project with a mysterious deadline, they still find time to use their genius to discover new ways to have fun.','https://image.tmdb.org/t/p/w500/5mVimQD1XOMLzbO2Qug0JQxh70S.jpg','1985-08-07',6.7,0),(22696,'The Hard Way','en','After learning of his brother\'s death during a mission in Romania, a former soldier joins two allies to hunt down a mysterious enemy and take his revenge.','https://image.tmdb.org/t/p/w500/hqkqvEkbwLYT1LIgyeK1FcD5Beu.jpg','2019-03-05',5.4,0),(22697,'Phenomenon','en','An ordinary man sees a bright light descend from the sky, and discovers he now has super-intelligence and telekinesis.','https://image.tmdb.org/t/p/w500/5eK1HNf0Kl2vDPOeqf1kX4SKxrw.jpg','1996-07-05',6.3,0),(22698,'Medusa\'s Venom','en','The beast is back and her venom is deadlier than ever. When newcomer Lola is welcomed into Medusa\'s circle, she endures a ritual to bring her closer to her new sisters.','https://image.tmdb.org/t/p/w500/cf15OW92LKzmuh3iWKGjXQbY0F3.jpg','2023-02-14',0,0),(22699,'Lights Out','en','A toymaker develops a method to create dolls that kill. This was a pilot for a proposed but unrealized TV series to be titled \"Light Out!,\" based on the much earlier radio program of the same name.','https://image.tmdb.org/t/p/w500/x14KvWnJppptwjpoy1stnD0wBgg.jpg','1972-01-15',6,0),(22700,'Nine Lives','en','A stuffy businessman finds himself trapped inside the body of his family\'s cat.','https://image.tmdb.org/t/p/w500/i457G22lL9t2yhEFdYz5Nd1M5DV.jpg','2016-08-03',5.7,0),(22701,'Honey 2','en','After a brush with the law, Maria has returned to her gritty Bronx roots to rebuild her life with nothing but a talent for street dance and a burning ambition to prove herself.','https://image.tmdb.org/t/p/w500/qQnWrF7khfYvpWdEeKhSuoDCGA5.jpg',