ing the person back to life.','https://image.tmdb.org/t/p/w500/wda3j7p7YHXKpFIlSzoTCtP7myF.jpg','1990-08-10',6.5,0),(22740,'Tower Block','en','A year after witnessing a murder, residents of Tower Block 31 find themselves being picked off by a sniper, pitting those lucky enough to be alive into a battle for survival.','https://image.tmdb.org/t/p/w500/ikUmaaOMbyeszWnyaIXye3f1GFe.jpg','2012-09-19',5.9,0),(22741,'Free State of Jones','en','In 1863, Mississippi farmer Newt Knight serves as a medic for the Confederate Army. Opposed to slavery, Knight would rather help the wounded than fight the Union. After his nephew dies in battle, Newt returns home to Jones County to safeguard his family but is soon branded an outlaw deserter. Forced to flee, he finds refuge with a group of runaway slaves hiding out in the swamps. Forging an alliance with the slaves and other farmers, Knight leads a rebellion that would forever change history.','https://image.tmdb.org/t/p/w500/pKhJLNHu5Aw8BgxOJ90lCmg0j0f.jpg','2016-06-24',6.7,0),(22742,'Little Manhattan','en','Ten-year-old Gabe was just a normal kid growing up in Manhattan until Rosemary Telesco walked into his life, actually into his karate class. But before Gabe can tell Rosemary how he feels, she tells him she will not be going to public school any more. Gabe has a lot more to learn about life, love, and girls.','https://image.tmdb.org/t/p/w500/z0RNI1NMtsvLsuTo1rWZfNHVs1z.jpg','2005-09-26',7.1,0),(22743,'Oliver Twist','en','Oliver Twist the modern filmed version of Charles Dickens bestseller, a Roman Polanski adaptation. The classic Dickens tale, where an orphan meets a pickpocket on the streets of London. From there, he joins a household of boys who are trained to steal for their master.','https://image.tmdb.org/t/p/w500/zhPdYZ3x2uanhM1SyBj4CuL6hSa.jpg','2005-09-23',6.7,0),(22744,'Bulbbul','hi','A child bride grows up to be an enigmatic woman presiding over her household, harboring a painful past as supernatural murders of men plag