 adventures of a group of Texas teens on their last day of school in 1976, centering on student Randall Floyd, who moves easily among stoners, jocks and geeks. Floyd is a star athlete, but he also likes smoking weed, which presents a conundrum when his football coach demands he sign a \"no drugs\" pledge.','https://image.tmdb.org/t/p/w500/lR8dzfCIdfaaSWagHHiFcJ6B4PI.jpg','1993-09-24',7.4,0),(22866,'Dog Pound','en','Three juvenile delinquents arrive at a correctional center and are put under the care of an experienced guard.','https://image.tmdb.org/t/p/w500/uyV9XhPpOE5MsvpTAd9FU585oIx.jpg','2010-04-24',7.3,0),(22867,'Last Man Standing','en','John Smith is a mysterious stranger who is drawn into a vicious war between two Prohibition-era gangs. In a dangerous game, he switches allegiances from one to another, offering his services to the highest bidder. As the death toll mounts, Smith takes the law into his own hands in a deadly race to stay alive.','https://image.tmdb.org/t/p/w500/uPashBUcbeFafdVgnHM2LL92jFB.jpg','1996-09-20',6.3,0),(22868,'Escape to Victory','en','A group of POWs in a German prison camp during World War II play the German National Soccer Team in this powerful film depicting the role of prisoners during wartime.','https://image.tmdb.org/t/p/w500/3j6H0dnbvjNXLK1l9nKguXw5vvO.jpg','1981-06-17',6.9,0),(22869,'The Snow Queen: Mirror Lands','ru','A mighty king has lost his family because of the Snow Queen. He finds a way to expel all magic creatures from his world to Mirrorlands. Gerda and Snow Queen, along with all wizards and magicians, have to forget their offenses and disputes to defend their right to exist and not to allow fairytales to disappear from our lives.','https://image.tmdb.org/t/p/w500/8251dVxltnhqbt2DaO9bwJYmvAK.jpg','2018-12-21',7.7,0),(22870,'Grace Unplugged','en','A talented young singer and aspiring songwriter’s Christian faith and family ties are tested when she defies her worship-pastor father and pursues pop-music stardom in GRACE UN