used Amerasian children in tow! Struggling to keep them alive while outmaneuvering a sadistic Vietnamese officer, Braddock ignites the jungle in a blazing cross-country race for freedom.','https://image.tmdb.org/t/p/w500/o8CjAqb58H3pmqVN8jysrO3sZXJ.jpg','1988-01-22',5.8,0),(22875,'The Entity','en','Carla Moran, a hard-working single mother,  is raped in her bedroom by someone — or something — that she cannot see. Despite skeptical psychiatrists, she is repeatedly attacked by this invisible force. Could this be a case of hysteria or something more horrific?','https://image.tmdb.org/t/p/w500/8hJBq9VAWK4PxfDg5lQZkUAaE8O.jpg','1982-09-30',6.6,0),(22876,'30 Nights of Paranormal Activity With the Devil Inside the Girl With the Dragon Tattoo','en','After a stint in a psychiatric hospital, a young woman returns to the house where her father killed the entire cast of The Artist during his exorcism.','https://image.tmdb.org/t/p/w500/f2YtZ8HHVt0F7sHg8r7GwlSKmKW.jpg','2013-01-14',4.1,0),(22877,'Father Christmas Is Back','en','Four sisters – Caroline, Joanna, Paulina, and Vicky – reunite for the Christmas Holiday in a Yorkshire mansion. However, their estranged father, James, joins in for the first time since he left the family behind decades prior. The group attempts to get through the holiday despite comedic misunderstandings, while also uncovering the long-buried secret that tore their family apart, so many years ago.','https://image.tmdb.org/t/p/w500/mI6mFCO3lrJ4ovzwfmoLs58uhlK.jpg','2021-11-07',4.7,0),(22878,'The Pirates! In an Adventure with Scientists!','en','The luxuriantly bearded Pirate Captain is a boundlessly enthusiastic, if somewhat less-than-successful, terror of the High Seas. With a rag-tag crew at his side, and seemingly blind to the impossible odds stacked against him, the Captain has one dream: to beat his bitter rivals Black Bellamy and Cutlass Liz to the much coveted Pirate of the Year Award. It’s a quest that takes our heroes from the shores of exotic Blood Island to the foggy streets of Victorian London. Along the way they battle a diabolical queen and team up with a haplessly smitten young scientist, but never lose sight of what a pirate loves best: adventure!','https://image.tmdb.org/t/p/w500/gxQWAhT2Hpsid1aBQQmQyYP6brw.jpg','2012-03-12',6.4,0),(22879,'American Murder: The Family Next Door','en','Using raw, firsthand footage, this documentary examines the disappearance of Shanann Watts and her children, and the terrible events that followed.','https://image.tmdb.org/t/p/w500/jjs3hE3mQlVGTX3u5ZH2EJBJpf3.jpg','2020-09-30',7.3,0),(22880,'The Peanut Butter Falcon','en','A down-on-his-luck crab fisherman embarks on a journey to get a young man with Down syndrome to a professional wrestling school in rural North Carolina and away from the retirement home where he’s lived for the past two and a half years.','https://image.tmdb.org/t/p/w500/qyQcRGvdW3VtxHR4fSDgPOePEip.jpg','2019-08-09',7.4,0),(22881,'The Aftermath','en','In the aftermath of World War II, a British colonel and his wife are assigned to live in Hamburg during the post-war reconstruction, but tensions arise with the German widower who lives with them.','https://image.tmdb.org/t/p/w500/slGZ8miznmAZAaDHEz6BKo7f1N5.jpg','2019-03-01',6.5,0),(22882,'Ewoks: The Battle for Endor','en','The army of the Marauders, led by King Terak and the witch Charal, attack the Ewoks village, killing Cindel\'s family. Cindel and the Ewok Wicket escape and meet Teek in the forest, a naughty and very fast animal. Teek takes them to a house in which an old man, Noa, lives. Like Cindel, he also crashed with his Starcruiser on Endor. Together they fight Terak and Charal.','https://image.tmdb.org/t/p/w500/ntgKdekb7xMKscyh2Hei706LBLf.jpg','1985-11-24',5.3,0),(22883,'Sex for Sale','cn','A Triad trafficking in firearms and drugs between Hong Kong and Zhuhai but most of their illicit activities were raided by the Chinese Police Officer, Ng. The Triad whistle blower Yuen, who was so angry that he kidnapped Ng\'s wife, maltreated her until she was unwillingly to be a prostitute in Hong Kong. Yuen\'s niece was a narcotics agent in Hong Kong Anti-drugs and Narcotics Bureau, cooperated with Ng to put Yuen in jail....','https://image.tmdb.org/t/p/w500/rWlOjz9EW1M8z8YrXEK6TFwkGtB.jpg','1993-02-19',7,0),(22884,'The 300 Spartans','en','Essentially true story of how Spartan king Leonidas led an extremely small army of Greek Soldiers (300 of his personal body guards from Sparta) to hold off an invading Persian army now thought to have numbered 250,000.','https://image.tmdb.org/t/p/w500/8VpEjt2QIlvJ9lC06vvYPdaiqm.jpg','1962-08-01',6.3,0),(22885,'Chariots of Fire','en','In the class-obsessed and religiously divided UK of the early 1920s, two determined young runners train for the 1924 Paris Olympics. Eric Liddell, a devout Christian born to Scottish missionaries in China, sees running as part of his worship of God\'s glory and refuses to train or compete on the Sabbath. Harold Abrahams overcomes anti-Semitism and class bias, but neglects his beloved sweetheart in his single-minded quest.','https://image.tmdb.org/t/p/w500/qnRaum8k0HqGRml2i7OawFqUtEb.jpg','1981-05-15',6.8,0),(22886,'The Thing from Another World','en','Scientists and US Air Force officials fend off a blood-thirsty alien organism while investigating at a remote arctic outpost.','https://image.tmdb.org/t/p/w500/rm2w8dEhOGDuckB6i0Spz9lTzpR.jpg','1951-04-05',6.8,0),(22887,'Mad Heidi','en','In a dystopian Switzerland that has fallen under the fascist rule of an evil cheese tyrant, Heidi lives the pure and simple life in the Swiss Alps. Grandfather Alpöhi does his best to protect Heidi, but her yearning for freedom soon gets her into trouble with the dictator’s henchmen. The innocent girl transforms herself into a kick-ass female fighting force who sets out to liberate the country from the insane cheese fascists.','https://image.tmdb.org/t/p/w500/wA0ZX8BC6AB6IimmKyMWT0PzUov.jpg','2022-11-24',6,0),(22888,'Th