. With The Fate of Adventure City hanging in the Balance, the Mighty Pups have to stop the Supervillains before it is too late, and Skye will need to learn that even the smallest Pup can make the Biggest Difference.','https://image.tmdb.org/t/p/w500/3J7WsMyzm77RJKuKV7CXu7GUdwJ.jpg','2023-10-11',0,0),(22904,'Dance with Me','en','Young Cuban Rafael just buried his mother, and comes to Houston to meet his father John for the first time. The difficult part is that John doesn\'t know he is Rafael\'s father. John runs a dance studio, and everyone prepares for the World Open Dance championship in Las Vegas. It soon becomes clear Rafael is a very good dancer, and Ruby is the biggest hope for the studio at the championship.','https://image.tmdb.org/t/p/w500/zNUxfWLFGfM7IC7LpxZqWRCnVMK.jpg','1998-08-21',6.8,0),(22905,'Darkness Falls','en','A vengeful spirit has taken the form of the Tooth Fairy to exact vengeance on the town that lynched her 150 years earlier. Her only opposition is the only child, now grown up, who has survived her before.','https://image.tmdb.org/t/p/w500/qoceKsM15yL5Tmyuhkdl7vM5Vi4.jpg','2003-01-24',5.5,0),(22906,'Witchcraft vs. Curse','cn','Hung is disappointed when her man, Yuk Lung, becomes engaged to pretty Pai Lin. Hung and her scheming mother engage a sorcerer, Ko Yin Yau, to place a spell on him. Yuk Lung becomes possessed by the Adultery Ghost, and he leaves Pai Lin in the middle of having sex with her, going to Hung. Pai Lin and her friend Nancy rush to Thailand, seeking the help of another sorcerer, Simol. The title alludes to the battle of the two spell-casters, through their two hosts. Along the way, plenty of excuses are found to get all the clothes off a number of lovely young women.','https://image.tmdb.org/t/p/w500/1TJ9UokiBmtKskNAo5Z6IlGEEHY.jpg','1991-04-20',3.3,0),(22907,'Apollo 18','en','Officially, Apollo 17 was the last manned mission to the moon. But a year later in 1973, three American astronauts were sent on a secret mission to the