ccidentally reveals her identity during what should have been a routine heist, she quickly finds herself mixed up in a government conspiracy and entangled in a deadly game of cat-and-mouse with a master assassin and his team of killers.  Armed with her own set of lethal skills, Alex looks to exact revenge for her murdered friends while uncovering the truth.','https://image.tmdb.org/t/p/w500/rStxrJBaWs3oNQfnQn4LKzG1lQ9.jpg','2015-10-15',5.7,0),(22914,'Space Cowboys','en','Frank Corvin, ‘Hawk’ Hawkins, Jerry O\'Neill and ‘Tank’ Sullivan were hotdog members of Project Daedalus, the Air Force\'s test program for space travel, but their hopes were dashed in 1958 with the formation of NASA and the use of trained chimps. They blackmail their way into orbit when Russia\'s mysterious ‘Ikon’ communications satellite\'s orbit begins to degrade and threatens to crash to Earth.','https://image.tmdb.org/t/p/w500/hPzt1bbA1sUDQOl6Vujmyz2hjLN.jpg','2000-08-04',6.4,0),(22915,'Valkyrie','en','Wounded in Africa during World War II, Nazi Col. Claus von Stauffenberg returns to his native Germany and joins the Resistance in a daring plan to create a shadow government and assassinate Adolf Hitler. When events unfold so that he becomes a central player, he finds himself tasked with both leading the coup and personally killing the Führer.','https://image.tmdb.org/t/p/w500/8eoRtXswC8IQDsqW7iJWO56NhAv.jpg','2008-12-25',6.9,0),(22916,'Titanic: 20 Years Later with James Cameron','en','For the 20th anniversary of \"Titanic,\" James Cameron reopens the file on the disaster.','https://image.tmdb.org/t/p/w500/5w18P8qU9sHRcW6pH3NVGVVIKFw.jpg','2017-11-26',6.5,0),(22917,'A Guilty Conscience','cn','After his negligence causes an innocent woman to go to jail, a lawyer and his colleagues work to clear her name.','https://image.tmdb.org/t/p/w500/bWoOAaVfpqkPGY79C8PSYBV4uJM.jpg','2023-01-20',7.4,0),(22918,'2gether: The Movie','th','Tine, a college student, wants to get rid of a gay admirer and his friends 