ve but abundant in lust. He quickly picks up the sinful way of life of the man who married his mother after she became pregnant from being raped. His \'father\'s\' mistress welcomes the young boy into her literal bosom. Wanting badly to know his real father, Jan leaves the house, only coming back after Khun Luang\'s daughter falls pregnant out of wedlock. Jan does a favor to his \'father\' by marrying her, even though he is deeply in love with the mistress. The truth about his birth, as Jan will later learn, is as confusing and messed up as his present life and the lives of those around him.','https://image.tmdb.org/t/p/w500/aZQaHR59HdJ4fQrhPnVtmS77Vka.jpg','2001-09-28',6.4,0),(22979,'Here Today','en','Veteran comedy writer Charlie Berns, who is slowly but surely losing his grip on reality, befriends a talented young New York street singer Emma Payge. Together, they form an unlikely yet hilarious and touching friendship that kicks the generation gap aside and redefines the meaning of love and trust.','https://image.tmdb.org/t/p/w500/xp64qD0V9SRE3jU6sEtQufAzYRk.jpg','2021-05-07',7.3,0),(22980,'Money Plane','en','A professional thief with $40 million in debt and his family\'s life on the line must commit one final heist - rob a futuristic airborne casino filled with the world\'s most dangerous criminals.','https://image.tmdb.org/t/p/w500/6CoRTJTmijhBLJTUNoVSUNxZMEI.jpg','2020-09-29',5.8,0),(22981,'The Best Offer','en','Virgil Oldman is a world renowned antiques expert and auctioneer. An eccentric genius, he leads a solitary life, going to extreme lengths to keep his distance from the messiness of human relationships. When appointed by the beautiful but emotionally damaged Claire to oversee the valuation and sale of her family’s priceless art collection, Virgil allows himself to form an attachment to her – and soon he is engulfed by a passion which will rock his bland existence to the core.','https://image.tmdb.org/t/p/w500/yfbsINSfotAHaeWKJbfsVKSckvq.jpg','2013-01-01'