al slacker KG and they form the rock band Tenacious D. Setting out to become the world\'s greatest band is no easy feat, so they set out to steal what could be the answer to their prayers... a magical guitar pick housed in a rock-and-roll museum some 300 miles away.','https://image.tmdb.org/t/p/w500/7iixTGu21JEWP8QclwJLqMt2RBH.jpg','2006-11-22',6.7,0),(22988,'Making The Witcher','en','Journey into the extraordinary world of \"The Witcher\" — from casting the roles to Jaskier\'s catchy song — in this behind-the-scenes look at the series. Go behind the monsters, the ballads and every bit of magic that went into bringing The Witcher\'s Continent to life.','https://image.tmdb.org/t/p/w500/zYnwBAUPQn5WmurROH1ravCC6Wp.jpg','2020-08-26',7.2,0),(22989,'Super Crazy','es','A 36-year-old meek woman realizes that there’s younger people trying to outpace her doing much less, so she makes a risky change by removing her filter.','https://image.tmdb.org/t/p/w500/xKT9Mv1SB7pW9TLOcmhcm9BH4Pc.jpg','2018-07-04',6.6,0),(22990,'Freaks','en','A circus\' beautiful trapeze artist agrees to marry the leader of side-show performers, but his deformed friends discover she is only marrying him for his inheritance.','https://image.tmdb.org/t/p/w500/idK9v05lDtXm67bylUhQyvVlZM6.jpg','1932-02-12',7.8,0),(22991,'Animal Farm','en','A successful farmyard revolution by the resident animals vs. the farmer goes horribly wrong when corrupt pigs hijack it for their personal gain.  Based on the socialist George Orwell’s novel “Animal Farm”, a critique of Stalinist authoritarianism.','https://image.tmdb.org/t/p/w500/bKVxSKZRrYYKaIzPHtBPaaCTYSh.jpg','1954-12-28',6.9,0),(22992,'The Killer','cn','Mob assassin Jeffrey is no ordinary hired gun; the best in his business, he views his chosen profession as a calling rather than simply a job. So, when beautiful nightclub chanteuse Jennie is blinded in the crossfire of his most recent hit, Jeffrey chooses to retire after one last job to pay for his unintended victim\'s