like he\'s 13, spending his days as the world\'s oldest video game tester and his evenings developing the next big Xbox game. But when he gets kicked out of his apartment, he\'s forced to move in with his grandmother.','https://image.tmdb.org/t/p/w500/fSRdHBtisU0zhks4OjKezI3jnt7.jpg','2006-01-06',6.6,0),(23017,'Confessions of a Teenage Drama Queen','en','Lola is an ambitious teenager who aspires to be a famous stage actress, but ger dream of performing on Broadway suffers a setback when her family moves from New York City to suburban New Jersey. Determined to make the best of it, however, Lola embarks on a mission to become the most popular girl at her high school, a goal that sets her on a collision course with the catty Carla Santini.','https://image.tmdb.org/t/p/w500/iDDEeG7cWyZnz2PJmCkCmWL2X5J.jpg','2004-02-17',5.6,0),(23018,'Marvel Studios Assembled: The Making of Doctor Strange in the Multiverse of Madness','en','Join visionary director Sam Raimi and the cast of the film as they recount their experiences bringing Marvel’s darkest story to life.  From world-building to universe-building, hear first hand accounts from the cast and crew on what it took to design, create and make each universe unique and believable.','https://image.tmdb.org/t/p/w500/9c89FC1gv0rwCqSP1LumIbrYA6a.jpg','2022-07-08',7.3,0),(23019,'Up in the Air','en','Corporate downsizing expert Ryan Bingham spends his life in planes, airports, and hotels, but just as he’s about to reach a milestone of ten million frequent flyer miles, he meets a woman who causes him to rethink his transient life.','https://image.tmdb.org/t/p/w500/wZRNEkDxVDNNVaCPN7jKziMHmk5.jpg','2009-09-05',6.8,0),(23020,'Eddie the Eagle','en','The feel-good story of Michael \'Eddie\' Edwards, an unlikely but courageous British ski-jumper who never stopped believing in himself—even as an entire nation was counting him out. With the help of a rebellious and charismatic coach, Eddie takes on the establishment and wins the hearts of sports fans around the world by making an improbable and historic showing at the 1988 Calgary Winter Olympics.','https://image.tmdb.org/t/p/w500/80fwjYfHmeDXobIErpNvCFCOAYd.jpg','2016-02-25',7.2,0),(23021,'Moonrise Kingdom','en','Set on an island off the coast of New England in the summer of 1965, Moonrise Kingdom tells the story of two twelve-year-olds who fall in love, make a secret pact, and run away together into the wilderness. As various authorities try to hunt them down, a violent storm is brewing off-shore – and the peaceful island community is turned upside down in more ways than anyone can handle.','https://image.tmdb.org/t/p/w500/xrziXRHRQ7c7YLIehgSJY8GQBsx.jpg','2012-05-16',7.7,0),(23022,'Bigfoot Family','en','Bigfoot, Adam\'s father, wants to use his fame for a good cause. Protecting a large wildlife reserve in Alaska sounds like the perfect opportunity! When Bigfoot mysteriously disappears without a trace, Adam and his animal friends will brave anything to find him again and save the nature reserve.','https://image.tmdb.org/t/p/w500/vn7sNO6CD8FBHBEVcOiNv08mjy1.jpg','2020-07-23',7.2,0),(23023,'The Spectacular Now','en','Sutter, a popular party animal, unexpectedly meets the introverted Aimee after waking up on a stranger\'s lawn. As Sutter deals with the problems in his life and Aimee plans for her future beyond school, an unexpected romance blossoms between them.','https://image.tmdb.org/t/p/w500/sTEhMxrL6dCOHB9lzY879kiIfIv.jpg','2013-08-02',6.6,0),(23024,'Scooby-Doo! and the Witch\'s Ghost','en','Scooby-Doo and the Mystery Gang visit Oakhaven, Massachusetts to seek strange goings on involving a famous horror novelist and his ancestor who is rumored be a witch.','https://image.tmdb.org/t/p/w500/82ixSN4fos7MFZKS8qABCfRGetj.jpg','1999-11-05',7.4,0),(23025,'A Trip to the Moon','fr','Professor Barbenfouillis and five of his colleagues from the Academy of Astronomy travel to the Moon aboard a rocket propelled by a giant cannon. Once on the lunar surface, the bold explorers face the many perils hidden in the caves of the mysterious planet.','https://image.tmdb.org/t/p/w500/9o0v5LLFk51nyTBHZSre6OB37n2.jpg','1902-04-17',7.9,0),(23026,'Sobibor','ru','The film is based on a real story that happened in 1943 in the Sobibor concentration camp in German-occupied Poland. The main character of the movie is the Soviet-Jewish soldier Alexander Pechersky, who at that time was serving in the Red Army as a lieutenant. In October 1943, he was captured by the Nazis and deported to the Sobibor concentration camp, where Jews were being exterminated in gas chambers. But, in just 3 weeks, Alexander was able to plan an international uprising of prisoners from Poland and Western Europe. This uprising resulted in being the only successful one throughout the war, which led to the largest escape of prisoners from a Nazi concentration camp.','https://image.tmdb.org/t/p/w500/dnexT2if0lRTp8jsGSOY4JVAnnj.jpg','2018-05-03',6.5,0),(23027,'Ronaldo','en','Filmed over 14 months with unprecedented access into the inner circle of the man and the sport, this is the first official and fully authorised film of one of the most celebrated figures in football.  For the first time ever, the world gets vividly candid and un-paralleled, behind-closed-doors access to the footballer, father, family-man and friend in this moving & fascinating documentary. Through in-depth conversations, state of the art football footage and never before seen archival footage, the film gives an astonishing insight into the sporting and personal life of triple Ballon D\'Or winner Cristiano Ronaldo at the peak of his career.  From the makers of ‘Senna’ and ‘Amy’, Ronaldo takes audiences on an intimate and revealing journey of what it’s like to live as an iconic athlete in the eye of the storm.','https://image.tmdb.org/t/p/w500/qdr6Jx39KErvSeQFVREjxeEK4lk.jpg','2015-11-09',6.9,0),(23028,'Porky\'s','en','Set in 1954, a group of Florida high schoolers seek out to lose their virginity which leads them to seek revenge on a sleazy nightclub owner and his redneck sheriff brother for harassing them.','https://image.tmdb.org/t/p/w500/AqCOt1cWfKqCepxK7LIdT812idH.jpg','1981-11-13',6.4,0),(23029,'4x4','es','Buenos Aires, Argentina. A luxurious van is parked on the sidewalk. A man enters with the purpose of stealing whatever he can find, but when he wants to leave, he cannot. The doors do not open, the control panel does not respond: the van has become an armored box and he is trapped like a mouse.','https://image.tmdb.org/t/p/w500/m58uZNmwVpbBZiBgICmBoKfREke.jpg','2019-04-04',6.4,0),(23030,'Batman & Mr. Freeze: SubZero','en','When Mr. Freeze kidnaps Barbara Gordon, as an involuntary organ donor to save his dying wife, Batman and Robin must find her before the operation can begin.','https://image.tmdb.org/t/p/w500/kjjz8mVNrwNUa9uz8IMnqS79rxj.jpg','1998-02-11',7,0),(23031,'Flightplan','en','Flying at 40,000 feet in a state-of-the art aircraft that she helped design, Kyle Pratt\'s 6-year-old daughter Julia vanishes without a trace. Or did she? No one on the plane believes Julia was ever onboard. And now Kyle, desperate and alone, can only count on her own wits to unravel the mystery and save her daughter.','https://image.tmdb.org/t/p/w500/oNjZFzbe7PfF3TxztNHDkinOPyB.jpg','2005-09-22',6.4,0),(23032,'Adrift','en','A true story of survival, as a young couple\'s chance encounter leads them first to love, and then on the adventure of a lifetime as they face one of the most catastrophic hurricanes in recorded history.','https://image.tmdb.org/t/p/w500/5gLDeADaETvwQlQow5szlyuhLbj.jpg','2018-06-08',6.9,0),(23033,'The Pink Panther 2','en','When legendary treasures from around the world are stolen, including the priceless Pink Panther Diamond, Chief Inspector Dreyfus is forced to assign Inspector Clouseau to a team of international detectives and experts charged with catching the thief and retrieving the stolen artifacts.','https://image.tmdb.org/t/p/w500/1XI20rOfPL6i9DrbO6GRWRxlQ60.jpg','2009-02-06',5.7,0),(23034,'The Librarian: Return to King Solomon\'s Mines','en','After retrieving the Crystal Skull in Utah, Flynn Carsen receives a map in the mail with the secret location of King Solomon\'s Mines. When the scroll is stolen, Judson explains the power of the Key of Solomon\'s book and assigns Flynn to retrieve the map. The map is useless without the legend piece to decipher it, which is located in Volubilis near the Roman ruins in Morocco. Flynn heads to Casablanca to the ruins where he is chased by a group of mercenaries leaded by General Samir. They too want to find the location of King Solomon\'s mines. Flynn teams-up with Professor Emily Davenport working in the dig and they escape from General Samir and his men. While traveling to Gedi, they save the local Jomo from death and the trio faces a dangerous journey through the wild Africa.','https://image.tmdb.org/t/p/w500/jK4BhFw9uNS6BKfAVlxX6Bnkj0J.jpg','2006-09-09',6.2,0),(23035,'Masterminds','en','A night guard at an armored car company in the Southern U.S. organizes one of the biggest bank heists in American history.','https://image.tmdb.org/t/p/w500/4CXgye1p8Vr7taDG389QhhHDUZ4.jpg','2016-09-29',5.7,0),(23036,'The Jungle Bunch','fr','Maurice may look like a penguin - but he\'s a real tiger inside! Raised by a tigress, he\'s the clumsiest kung-fu master ever. Along with his friends, The Jungle Bunch, he intends to maintain order and justice in the jungle, as his mother did before he. But Igor, an evil koala, wants to destroy the jungle once and for all—helped by his army of silly baboons.','https://image.tmdb.org/t/p/w500/rZ0T0yRe8iDqAgeZXRNvpAJh5z1.jpg','2017-07-26',6.4,0),(23037,'The Shadow','en','Based on the 1930\'s comic strip, puts the hero up against his arch enemy, Shiwan Khan, who plans to take over the world by holding a city to ransom using an atom bomb. Using his powers of invisibility and \"The power to cloud men\'s minds\", the Shadow comes blazing to the city\'s rescue with explosive results.','https://image.tmdb.org/t/p/w500/xAbFJH3vQYZvUyzzGAtG4OLy492.jpg','1994-07-01',6,0),(23038,'Titan A.E.','en','A young man finds out that he holds the key to restoring hope and ensuring survival for the human race, while an alien species called the Drej are bent on mankind\'s destruction.','https://image.tmdb.org/t/p/w500/el2iHk3LTJWfEnwrvcRkvWY501G.jpg','2000-06-16',6.6,0),(23039,'Force of Nature','en','A gang of thieves plan a heist during a hurricane and encounter trouble when a disgraced cop tries to force everyone in the building to evacuate.','https://image.tmdb.org/t/p/w500/ucktgbaMSaETUDLUBp1ubGD6aNj.jpg','2020-07-02',5.2,0),(23040,'The Conversation','en','Surveillance expert Harry Caul is hired by a mysterious client\'s brusque aide to tail a young couple. Tracking the pair through San Francisco\'s Union Square, Caul and his associate Stan manage to record a cryptic conversation between them. Tormented by memories of a previous case that ended badly, Caul becomes obsessed with the resulting tape, trying to determine if the couple is in danger.','https://image.tmdb.org/t/p/w500/rI5EmMjfM2lOMzIPhnhD8mp0lVp.jpg','1974-04-07',7.5,0),(23041,'The Rhythm Section','en','When she discovers the plane crash that claimed the lives of her family was no accident, Stephanie Patrick enters the dark, complex world of international espionage seeking vengeance. With nothing left to lose, Stephanie transforms from victim to assassin and discovers that neither revenge nor the truth are what they appear.','https://image.tmdb.org/t/p/w500/spTr0VYyRtl36Lkk6nCnnbFXhus.jpg','2020-01-31',5.6,0),(23042,'Adventures in Babysitting','en','Two teen rival babysitters, Jenny and Lola, team up to hunt down one of their kids who accidentally ran away into the big city without any supervision.','https://image.tmdb.org/t/p/w500/xuCPo0krpAcK2s1uMCZs93turdk.jpg','2016-06-24',7.3,0),(23043,'Raw Deal','en','Mark Kaminsky is kicked out of the FBI for his rough treatment of a suspect. He winds up as the sheriff of a small town in North Carolina. FBI Chief Harry Shannon, whose son has been killed by a mobster named Patrovina, enlists Kaminsky in a personal vendetta with a promise of reinstatement into the FBI if Patrovina is taken down. To accomplish this, he must go undercover and join Patrovina\'s gang.','https://image.tmdb.org/t/p/w500/e27G0o01y6aPYn6OScB2G6NbqVz.jpg','1986-06-06',5.8,0),(23044,'Dark Web: Cicada 3301','en','Genius hacker Connor discovers Cicada 3301, an online treasure hunt that could be a recruiting tool for a secret society. Soon Conner, art-expert friend Avi, and secretive librarian Gwen are dashing from graffiti sites to ancient libraries to uncover real-world clues. But they must outrun aggressive NSA agents, also hot on the trail of Cicada, who want the glory for themselves.','https://image.tmdb.org/t/p/w500/tJlLfuvIBBn5aFoyW1IQWeFHl6v.jpg','2021-03-12',6.2,0),(23045,'The Tunnel','no','When a truck crashes inside a tunnel, people on their way home for Christmas are brutally trapped in a deadly fire. With a blizzard raging outside, and the first responders struggling to get to the accident, it\'s every man for himself.','https://image.tmdb.org/t/p/w500/x2Nkkk0znwNDtqCdZKFQNA4Ayxg.jpg','2019-12-25',6.3,0),(23046,'Mini\'s First Time','en','Desperate to be free from her drunken, unloving mother Diane, the beautiful, scheming young Mini seduces her stepfather Martin and soon convinces him to join her in a sadistic scheme to have Diane declared insane. But their conspiracy soon escalates to murder and when John Garson, a young detective starts investigating, Martin and Mini begin to turn on each other.','https://image.tmdb.org/t/p/w500/8LSbj1iwkxM7AZRTKxCxfdmE4Lt.jpg','2006-07-14',5.7,0),(23047,'Kalashnikov AK-47','ru','Tank commander Kalashnikov is severely injured in battle in 1941. The accident leaves him incapacitated and unable to return to the front line. While recovering in the hospital he begins creating the initial sketches of what will become one of the world’s most legendary weapons. A self-taught inventor, Mikhail Kalashnikov, is only 29 when he develops the now iconic assault riffle — the AK-47.','https://image.tmdb.org/t/p/w500/ApfjrFsGunqLo5MKYGtFMTSTaMq.jpg','2020-02-20',7.5,0),(23048,'Caligula: The Untold Story','it','The deranged Roman emperor Gainus \'Caligula\' (Little Boots) Caesar (12-41 A.D.) rules Rome with an iron fist and has anyone tortured and exectued for even the slightest insubordination. Mostly set during his last year of his reign, as Caligula loses support due to his brutal and crazed excess, a young Moor woman, named Miriam, becomes his lover while ploting to kill him to avenge the murder of a friend which Caligula was responsible for. But Miriam is torn between her personal vandeda against Caligula and her own personal feelings towards him despite his madness and debauched lifestyle of orgies and bloody torture murders.','https://image.tmdb.org/t/p/w500/zVqzfoI6jeRXiE8FUDnHpdZUApN.jpg','1982-02-02',5.4,0),(23049,'The Night Before','en','In New York City for their annual tradition of Christmas Eve debauchery, three lifelong best friends set out to find the Holy Grail of Christmas parties since their yearly reunion might be coming to an end.','https://image.tmdb.org/t/p/w500/rfeNBaiMBg0UQsBQFv1qsjTjZWn.jpg','2015-11-20',6.1,0),(23050,'Syriana','en','The Middle Eastern oil industry is the backdrop of this tense drama, which weaves together numerous story lines. Bennett Holiday is an American lawyer in charge of facilitating a dubious merger of oil companies, while Bryan Woodman, a Switzerland-based energy analyst, experiences both personal tragedy and opportunity during a visit with Arabian royalty. Meanwhile, veteran CIA agent Bob Barnes uncovers an assassination plot with unsettling origins.','https://image.tmdb.org/t/p/w500/mO3hWUTOxmLJxihvDU0YFkb0Mb5.jpg','2005-11-23',6.4,0),(23051,'Calendar Girl, Cop, Killer? The Bambi Bembenek Story','en','Story of attractive cop Laurencia Bembenek, who, in 1982, was sentenced to prison for killing her husband\'s ex-wife in Milwaukee, WI.','https://image.tmdb.org/t/p/w500/pRFPXLBDk21nFD71xJrSxFHhrwX.jpg','1992-05-18',2,0),(23052,'Blazing Saddles','en','A town—where everyone seems to be named Johnson—stands in the way of the railroad. In order to grab their land, robber baron Hedley Lemar sends his henchmen to make life in the town unbearable. After the sheriff is killed, the town demands a new sheriff from the Governor, so Hedley convinces him to send the town the first black sheriff in the west.','https://image.tmdb.org/t/p/w500/nb1MLEOXVFBKTM4J9GLoksqgDBk.jpg','1974-02-07',7.3,0),(23053,'La Bamba','en','Los Angeles teenager Ritchie Valens becomes an overnight rock \'n\' roll success in 1958, thanks to a love ballad called \"Donna\" that he wrote for his girlfriend. But as his star rises, Valens has conflicts with his jealous brother, Bob, and becomes haunted by a recurring nightmare of a plane crash just as he begins his first national tour alongside Buddy Holly.','https://image.tmdb.org/t/p/w500/6Znulqtc7cdqlUC69HGf26Ef5fi.jpg','1987-07-24',7.2,0),(23054,'Tale of Tales','it','The Queen of Selvascura risks everything to be a mother; the King of Roccaforte falls in love with the voice of a mysterious girl; the King of Altomonte becomes obsessed with a flea and neglects his daughter.','https://image.tmdb.org/t/p/w500/ryZsoaYmcEJsye6P5uo5thEjpqB.jpg','2015-05-14',6.4,0),(23055,'TEKKEN: A Man Called X','en','A young man, Kazuya Mishima, wakes up alone in an unfamiliar hotel room without any recollection of who he is or how he got there. He is tormented by flashes of his past and by the face of an ominous stranger. The next thing he knows, Kazuya is ambushed and kidnapped by an underground crime organization and, soon after, turned into a ruthless assassin.  During a mission to assassinate a man named Brian Fury, Kazuya finds that his target harbors clues to his true identity. With the help of Fury and a female assassin, Kazuya follows the clues, leading him to the lab of his reoccurring flashbacks. Here, he will finally confront his past and the ominous man of his nightmares - Heihachi Mishima, face the ultimate betrayal, and Ieam the truth about who, and what, he really is.  TEKKEN 2: KAZUYA’S REVENGE is non-stop action from the first scene to the last.','https://image.tmdb.org/t/p/w500/wFpOsSlkC922RCHeaC97qo19ARA.jpg','2014-08-12',4,0),(23056,'Wall Street','en','A young and impatient stockbroker is willing to do anything to get to the top, including trading on illegal inside information taken through a ruthless and greedy corporate raider whom takes the youth under his wing.','https://image.tmdb.org/t/p/w500/2tQYq9ntzn2dEwDIGLBSipYPenv.jpg','1987-12-10',7.2,0),(23057,'Tootsie','en','When struggling, out of work actor Michael Dorsey secretly adopts a female alter ego - Dorothy Michaels - in order to land a part in a daytime drama, he unwittingly becomes a feminist icon and ends up in a romantic pickle.','https://image.tmdb.org/t/p/w500/x9cBsqf64j8e5a8PwThT3I6sHFK.jpg','1982-12-17',7.2,0),(23058,'The Counselor','en','A lawyer finds himself in far over his head when he attempts to get involved in drug trafficking.','https://image.tmdb.org/t/p/w500/aNiLkGnzVb5CorZHKk16w9S4COt.jpg','2013-10-25',5.3,0),(23059,'Gwen Shamblin: Starving for Salvation','en','Gwen Shamblin, a charismatic with a curated image, became known with her Christian diet program \"Weigh Down Workshop\", and was accused of exploitation and emotional, psychological, and physical abuse by the church\'s alleged cult practices.','https://image.tmdb.org/t/p/w500/mtvOSet5NRSB4Qu4cHTVzCfRcZJ.jpg','2023-02-04',7,0),(23060,'The Score','en','An aging thief hopes to retire and live off his ill-gotten wealth when a young kid convinces him into doing one last heist.','https://image.tmdb.org/t/p/w500/fsb4m9XW59mei8GKznvI3lLzcfp.jpg','2001-07-13',6.7,0),(23061,'Blindness','en',