n of a New Era (25 min) Making Prehistory (20 min), the Next Step in Evolution (15 min), and the Third Adventure (25 min), Finding the Lost World (28 min), and Something Survived (16 min).','https://image.tmdb.org/t/p/w500/mPyu59cDdmMDDW9IOtfjVlM0THd.jpg','2011-02-05',6.6,0),(23066,'LEGO DC Comics Super Heroes: Justice League vs. Bizarro League','en','Superman’s clone, Bizarro, has become an embarrassing problem. Chaos and destruction follow Bizarro everywhere as he always hears the opposite of what is said, says the opposite of what he means and does the opposite of what is right. And when the citizens of Metropolis keep confusing Bizarro with Superman, the Man of Steel decides it’s time to find a new home for him…on another planet! It’s up to the Justice League to come to terms with their backward counterparts and team up with them to stop Darkseid and save the galaxy!','https://image.tmdb.org/t/p/w500/vgc2Qxd4f7On51sjzimLmbfO4Cf.jpg','2015-02-10',6.7,0),(23067,'Kelly\'s Heroes','en','A misfit group of World War II American soldiers goes AWOL to rob a bank behind German lines.','https://image.tmdb.org/t/p/w500/1EDg4nmLFNYiOUoNgo6WiPrAMif.jpg','1970-06-22',7.4,0),(23068,'Cooties','en','A mysterious virus hits an isolated elementary school, transforming the kids into a feral swarm of mass savages. An unlikely hero must lead a motley band of teachers in the fight of their lives.','https://image.tmdb.org/t/p/w500/qnH3SCfb3ePz9qM8BvBtq9JLLXY.jpg','2014-10-10',5.9,0),(23069,'The Death of the Incredible Hulk','en','During the critical experiment that would rid David Banner of the Hulk,a spy sabotages the laboratory. Banner falls in love with the spy, Jasmin, who performs missions only because her sister is being held hostage by Jasmin\'s superiors. Banner and Jasmin try to escape from the enemy agents to rebuild their lives together, but the Hulk is never far from them.','https://image.tmdb.org/t/p/w500/bqnLwNroY4wdQ5TGZd4o92wwlBm.jpg','1990-02-18',5.1,0),(23070,'Gretel 