.org/t/p/w500/9RMcwwnK8a9WCt8dVlwmtNsFCg3.jpg','2001-09-14',6.4,0),(23076,'Robinson Crusoe','de','On a tiny exotic island, Tuesday, an outgoing parrot lives with his quirky animal friends in paradise. However, Tuesday can\'t stop dreaming about discovering the world. After a violent storm, Tuesday and his friends wake up to find a strange creature on the beach: Robinson Crusoe. Tuesday immediately views Crusoe as his ticket off the island to explore new lands. Likewise, Crusoe soon realizes that the key to surviving on the island is through the help of Tuesday and the other animals. It isn\'t always easy at first, as the animals don\'t speak \"human.\" Slowly but surely, they all start living together in harmony, until one day, when their comfortable life is overturned by two savage cats, who wish to take control of the island. A battle ensues between the cats and the group of friends but Crusoe and the animals soon discover the true power of friendship up against all odds (even savage cats).','https://image.tmdb.org/t/p/w500/7diAAfF2nsdy6Z5E2TOFfGomrvT.jpg','2016-02-04',5.8,0),(23077,'The Swan Princess: Escape from Castle Mountain','en','The first wedding anniversary of Princess Odette and Prince Derek is distracted by field fires set by Knuckles. His master Clavius, wants to conquer the world, and he needs to capture a giant orb to do that. Clavius kidnaps Queen Uberta and Odette with Derek have to save her.','https://image.tmdb.org/t/p/w500/baMeQSxukVdPVQUSGhtKe6fA4aR.jpg','1997-06-19',6.1,0),(23078,'7500','en','When terrorists try to seize control of a Berlin-Paris flight, a soft-spoken young American co-pilot struggles to save the lives of the passengers and crew while forging a surprising connection with one of the hijackers.','https://image.tmdb.org/t/p/w500/hL2uecLh2rTTbuVbOriXP0PhqIJ.jpg','2019-12-26',6.1,0),(23079,'Early Man','en','Dug, along with his sidekick Hognob, unite a cavemen tribe to save their hidden valley from being spoiled and, all together as a team, to face the menace of a mysterious and mighty enemy, on the turf of an ancient and sacred sport.','https://image.tmdb.org/t/p/w500/hXukFwTKOe7izDsf3ZOdeYikRxF.jpg','2018-01-26',6.2,0),(23080,'Paranoia','en','An entry-level employee at a powerful corporation finds himself occupying a corner office, but at a dangerous price—he must spy on his boss\'s old mentor to secure for him a multi-billion dollar advantage.','https://image.tmdb.org/t/p/w500/isbiljuGztxLlcOvrSw5FkQDGEd.jpg','2013-08-14',5.7,0),(23081,'Murder at 1600','en','A secretary is found dead in a White House bathroom during an international crisis, and Detective Harlan Regis is in charge of the investigation. Despite resistance from the Secret Service, Regis partners with agent Nina Chance. As political tensions rise, they learn that the crime could be part of an elaborate cover-up. Framed as traitors, the pair, plus Regis\' partner, break into the White House in order to expose the true culprit.','https://image.tmdb.org/t/p/w500/5S469MSJIzb6J0PIsghUn52uzfP.jpg','1997-04-18',6.1,0),(23082,'The Day the Earth Stood Still','en','An alien and a robot land on Earth after World War II and tell mankind to be peaceful or face destruction.','https://image.tmdb.org/t/p/w500/x2DquTpLTq54aPFDnqlwY7apCC3.jpg','1951-09-28',7.5,0),(23083,'The Party','en','Hrundi V. Bakshi, an accident-prone actor from India, is accidentally put on the guest list for an upcoming party at the home of a Hollywood film producer. Unfortunately, from the moment he arrives, one thing after another goes wrong with compounding effect.','https://image.tmdb.org/t/p/w500/pC6FB4fLIVRCpMzIbUf1xOVobmz.jpg','1968-04-04',7.3,0),(23084,'The Cabinet of Dr. Caligari','de','Francis, a young man, recalls in his memory the horrible experiences he and his fiancée Jane recently went through. Francis and his friend Alan visit The Cabinet of Dr. Caligari, an exhibit where the mysterious doctor shows the somnambulist Cesare, and awakens him for some moments from his death-like sleep.','https://image.tmdb.org/t/p/w500/myK9DeIsXWGKgUTZyGXg2IfFk0W.jpg','1920-02-27',7.9,0),(23085,'Sex, Shame and Tears 2','es','Twenty years have passed since those two apartments in the heart of Mexico City were the battlefield of a war of the sexes between Ana, Carlos, Andrea, Miguel, Tomás and María. All that is left of those apartments are memories and the image of Tomás\' dead body at the bottom of the elevator shaft. Their lives have changed, their families have grown and new and unexpected characters have come to unsettle their daily lives and trigger a chain of events that will make them realize that modesty has been replaced by public disclosure; sex is only an app away; but love...love is still something elusive that everyone in today\'s banal and chaotic world is seeking.','https://image.tmdb.org/t/p/w500/tgCA3cO2pM8UTPU3P81ZRbyp0VW.jpg','2022-02-04',6.4,0),(23086,'The Adventures of Ichabod and Mr. Toad','en','The Wind in the Willows: Concise version of Kenneth Grahame\'s story of the same name. J. Thaddeus Toad, owner of Toad Hall, is prone to fads, such as the newfangled motor car. This desire for the very latest lands him in much trouble with the wrong crowd, and it is up to his friends, Mole, Rat and Badger to save him from himself. - The Legend of Sleepy Hollow: Retelling of Washington Irving\'s story set in a tiny New England town. Ichabod Crane, the new schoolmaster, falls for the town beauty, Katrina Van Tassel, and the town Bully Brom Bones decides that he is a little too successful and needs \"convincing\" that Katrina is not for him.','https://image.tmdb.org/t/p/w500/1MpPEstGQPEsLJM9FGHqJUGtO6S.jpg','1949-10-05',6.5,0),(23087,'Curse of the Golden Flower','zh','During China\'s Tang dynasty the emperor has taken the princess of a neighboring province as his wife. She has borne him two sons and raised his eldest. Now his control over his dominion is complete, including the royal family itself.','https://image.tmdb.org/t/p/