 of a severely traumatized daughter enlists the aid of a unique horse trainer to help the girl\'s equally injured horse.','https://image.tmdb.org/t/p/w500/1Ptdh2fdA5xpH5Zj8AQUAp9Tdoa.jpg','1998-02-01',6.9,0),(23096,'Jobs','en','The story of Steve Jobs\' ascension from college dropout into one of the most revered creative entrepreneurs of the 20th century.','https://image.tmdb.org/t/p/w500/qkHr510BpWnibuIWnjycvvI29jL.jpg','2013-08-16',6.1,0),(23097,'Tomcats','en','College buddies chip in and promise that the group\'s last unmarried man will collect a cash pot. Seven years later, the kitty is worth $500,000 -- money Michael needs to pay a gambling debt. Problem is, the only other single guy is a hopeless womanizer!','https://image.tmdb.org/t/p/w500/LpIAhTgwyh22Y4BhYbEsZv0u9W.jpg','2001-03-30',5.1,0),(23098,'Mickey\'s Once Upon a Christmas','en','Mickey, Minnie, and their famous friends Goofy, Donald, Daisy and Pluto gather together to reminisce about the love, magic and surprises in three wonder-filled stories of Christmas past.','https://image.tmdb.org/t/p/w500/iBmKN7zS8fl0rhgtOr9T8BM90k8.jpg','1999-10-31',7.1,0),(23099,'The Escort Wife','tl','A wife who just had a miscarriage finds out that her husband is having an affair with a high-end escort. She turns into prostitution and will take her revenge on her...','https://image.tmdb.org/t/p/w500/PDmMLfAsJKgi9stkipDi27bCTZ.jpg','2022-09-16',5,0),(23100,'The Hunchback of Notre Dame','en','Paris, France, 1482. Frollo, Chief Justice of benevolent King Louis XI, gets infatuated by the beauty of Esmeralda, a young Romani girl. The hunchback Quasimodo, Frollo\'s protege and bell-ringer of Notre Dame, lives in peace among the bells in the heights of the immense cathedral until he is involved by the twisted magistrate in his malicious plans to free himself from Esmeralda\'s alleged spell, which he believes to be the devil\'s work.','https://image.tmdb.org/t/p/w500/unaJXRStMmGBjhIZcaRP8fARA12.jpg','1939-12-29',7.3,0),(23101,'A Nightmare on Elm Street: The Dream Child','en','Alice, having survived the previous installment of the Nightmare series, finds the deadly dreams of Freddy Krueger starting once again. This time, the taunting murderer is striking through the sleeping mind of Alice\'s unborn child. His intention is to be \"born again\" into the real world. The only one who can stop Freddy is his dead mother, but can Alice free her spirit in time to save her own son?','https://image.tmdb.org/t/p/w500/zsCIUEdPKLO1GLJ2je9mKpPkQ70.jpg','1989-08-11',5.4,0),(23102,'In the Bedroom','en','Summertime on the coast of Maine, \"In the Bedroom\" centers on the inner dynamics of a family in transition. Matt Fowler is a doctor practicing in his native Maine and is married to New York born Ruth Fowler, a music teacher. His son is involved in a love affair with a local single mother. As the beauty of Maine\'s brief and fleeting summer comes to an end, these characters find themselves in the midst of unimaginable tragedy.','https://image.tmdb.org/t/p/w500/4FIlOw7P2Yusdl7TqHFvKC1eMQ4.jpg','2001-11-23',6.9,0),(23103,'When in Rome','en','After fishing out coins from a water fountain in Italy, cynical New Yorker Beth Harper finds herself being wooed by several ardent suitors. As she deals with the attention, Beth tries to figure out whether a charming reporter really loves her.','https://image.tmdb.org/t/p/w500/pteIGpJpgh2aUh3jMqZnomB1rw1.jpg','2010-01-29',6,0),(23104,'Be Careful What You Wish For','es','Pamela is an eight-year-old girl who loves horror movies and fairy tales. When his uncle gives her away a doll named \"Hellequin\" as a birthday gift, a tale of betrayal begins to unfold before her eyes.','https://image.tmdb.org/t/p/w500/lG6Wx5tWOEHkOuexEvNYha3ofvM.jpg','2020-04-24',6.7,0),(23105,'A Christmas Story','en','The comic mishaps and adventures of a young boy named Ralph, trying to convince his parents, teachers, and Santa that a Red Ryder B.B. gun really is the perfect Christmas gift for the 1940s.','https://image.tmdb.org/t/p/w500/f3VITMLSmP3Ai65AvXT54RcF5Sw.jpg','1983-11-18',7.3,0),(23106,'Vamps','en','The modern-day story focuses on two beautiful young vampires who are living the good nightlife in New York until love enters the picture and each has to make a choice that will jeopardize their immortality.','https://image.tmdb.org/t/p/w500/sW4MFTfW88Ii8TyZVD7oprzzhOU.jpg','2012-08-25',5.3,0),(23107,'10x10','en','Lewis is an outwardly ordinary guy, but in reality he is hiding an obsession – revenge – against Cathy. Lewis kidnaps Cathy in broad daylight and takes her to his home, where he locks her in a soundproof cell and attempts to extract a dark secret from her past.','https://image.tmdb.org/t/p/w500/egMETBYual2JtfFGigXTA0tGkME.jpg','2018-04-13',5.3,0),(23108,'Asterix and Cleopatra','fr','Popular animated hero Asterix and his faithful sidekick Obelix travel to ancient Egypt to help Cleopatra build a new summer home. Cleopatra and Julius Caesar have made a bet, with Caesar wagering the project cannot be completed in a few weeks time. With the help of a magic potion, Asterix comes to the rescue of the Queen of the Nile as Caesar and an angry architect plot against them.','https://image.tmdb.org/t/p/w500/gNpKAmWFsCiWKKx39Ap8pF7EWQg.jpg','1968-12-16',7,0),(23109,'Harley Davidson and the Marlboro Man','en','It\'s the lawless future, and renegade biker Harley Davidson and his surly cowboy buddy, Marlboro, learn that a corrupt bank is about to foreclose on their friend\'s bar to further an expanding empire. Harley and Marlboro decide to help by robbing the crooked bank. But when they accidentally filch a drug shipment, they find themselves on the run from criminal financiers and the mob in this rugged action adventure.','https://image.tmdb.org/t/p/w500/4WRdrjHyLuHRwep2UJWBoIn6KTW.jpg','1991-08-23',6.3,0),(23110,'Analyze That','en','The mafia\'s Paul Vitti is back in prison and will need some serious counseling when he gets out. Naturally, he returns to his analyst Dr. Ben Sobel for help and finds that Sobel needs some serious help himself as he has inherited the family practice, as well as an excess stock of stress.','https://image.tmdb.org/t/p/w500/q3R6Hno3WFfIkHQg7CeVAEOcHQQ.jpg','2002-12-06',5.8,0),(23111,'The Double','en','The mysterious murder of a US senator bearing the distinctive trademark of the legendary Soviet assassin \'Cassius\', forces retired CIA operative, Paul Shepherson to team with rookie FBI agent, Ben Geary  to solve the crime. Having spent his career chasing Cassius, Shepherdson is convinced his nemesis is long dead, but is pushed to take on the case by his former supervisor, Tom Highland. Geary, who wrote his Master\'s thesis on Shepherdson\'s pursuit of the Soviet killer, is certain that Cassius has resurfaced.','https://image.tmdb.org/t/p/w500/t4W10sjJSDAWRUDn2Kb8DQKxiZv.jpg','2011-10-27',5.8,0),(23112,'The Hobbit','en','Bilbo Baggins the Hobbit was just minding his own business, when his occasional visitor Gandalf the Wizard drops in one night. One by one, a whole group of dwarves drop in, and before he knows it, Bilbo has joined their quest to reclaim their kingdom, taken from them by the evil dragon Smaug. The only problem is that Gandalf has told the dwarves that Bilbo is an expert burglar, but he isn\'t...','https://image.tmdb.org/t/p/w500/2ohvyMPhvjftLrM6S6Ljr6QrL0u.jpg','1977-11-27',6.3,0),(23113,'The \'Burbs','en','When secretive new neighbors move in next door, suburbanite Ray Peterson and his friends let their paranoia get the best of them as they start to suspect the newcomers of evildoings and commence an investigation. But it\'s hardly how Ray, who much prefers drinking beer, reading his newspaper and watching a ball game on the tube expected to spend his vacation.','https://image.tmdb.org/t/p/w500/vrVPAcv2njVdnkqhBwGBc7UxCjz.jpg','1989-02-17',6.7,0),(23114,'Porno','es','','https://image.tmdb.org/t/p/w500/71mtgKoyaot9SKCtmQKLr0HoAzm.jpg','2006-03-10',4,0),(23115,'Isi & Ossi','de','Isi and Ossi couldn\'t be any more different: She\'s a billionaire\'s daughter from Heidelberg, he\'s a struggling boxer from the nearby town of Mannheim. But when Isi meets Ossi, the two quickly realize that they can take advantage of one another: She dates the broke boxer to provoke her parents and get them to fund a long-desired chef training in New York. He tries to rip off the rich daughter to finance his first professional boxing match. Their plans soon develop into emotional chaos that challenges everything the two believe to know about money, career and love.','https://image.tmdb.org/t/p/w500/bZ7H0kCwEM6CQ0dyCs2H4RkU130.jpg','2020-02-14',6.9,0),(23116,'The Teasers','it','Loredana is a schoolgirl who takes advantage of her fellow students and teachers by using her innocent schoolgirl beauty. After she loses her virginity to an older man she soon realizes there are more important things to life than teasing men.','https://image.tmdb.org/t/p/w500/nEDUPz4zkuteERpTXNQUveiYz4t.jpg','1975-10-31',5.1,0),(23117,'Where Hands Touch','en','Germany, 1944. Leyna, the 15-year old daughter of a white German mother and a black African father, meets Lutz, a compassionate member of the Hitler Youth whose father is a prominent Nazi soldier, and they form an unlikely connection in this quickly changing world.','https://image.tmdb.org/t/p/w500/omKzydOrom9kpdfQUE0G9Y9sPl0.jpg','2018-09-14',8,0),(23118,'Sabrina','en','Linus and David Larrabee are the two sons of a very wealthy family. Linus is all work – busily running the family corporate empire, he has no time for a wife and family. David is all play – technically he is employed by the family business, but never shows up for work, spends all his time entertaining, and has been married and divorced three times. Meanwhile, Sabrina Fairchild is the young, shy, and awkward daughter of the household chauffeur, who goes away to Paris for two years, and returns to capture David\'s attention, while falling in love with Linus.','https://image