om prison and do their best to stay out trouble. While trying to mind their own business (and run their 5-Star Cleaning Service), they are caught up in a war between rival Triad gangs fighting for control of the counterfeit currency market.','https://image.tmdb.org/t/p/w500/ngFYme3fGnwkssHkPXZr3peI6iW.jpg','1983-07-07',6.9,0),(23126,'The Dead Zone','en','Johnny Smith is a schoolteacher with his whole life ahead of him but, after leaving his fiancee\'s home one night, is involved in a car crash which leaves him in a coma for 5 years. When he wakes, he discovers he has an ability to see into the past, present and future life of anyone with whom he comes into physical contact.','https://image.tmdb.org/t/p/w500/9yTVaeS8eIkOpbwIycVFm7EQrgF.jpg','1983-10-21',7,0),(23127,'Rounders','en','A young reformed gambler must return to playing big stakes poker to help a friend pay off loan sharks.','https://image.tmdb.org/t/p/w500/7JfFYnOLWi2X4TZXJ7qQ7xO1D2x.jpg','1998-09-11',7,0),(23128,'Hackers','en','Along with his new friends, a teenager who was arrested by the US Secret Service and banned from using a computer for writing a computer virus discovers a plot by a nefarious hacker, but they must use their computer skills to find the evidence while being pursued by the Secret Service and the evil computer genius behind the virus.','https://image.tmdb.org/t/p/w500/w8H2KpRtpzwlxz5KrvINCVihok1.jpg','1995-09-14',6.3,0),(23129,'The Tree of Life','en','The impressionistic story of a Texas family in the 1950s. The film follows the life journey of the eldest son, Jack, through the innocence of childhood to his disillusioned adult years as he tries to reconcile a complicated relationship with his father. Jack finds himself a lost soul in the modern world, seeking answers to the origins and meaning of life while questioning the existence of faith.','https://image.tmdb.org/t/p/w500/l8cwuB5WJSoj4uMAsnzuHBOMaSJ.jpg','2011-05-17',6.7,0),(23130,'The Marine 5: Battleground','en','While working as 