eknownst to Renfield, a vampire. After Dracula enslaves Renfield and drives him to insanity, the pair sail to London together, and as Dracula begins preying on London socialites, the two become the subject of study for a supernaturalist professor, Abraham Van Helsing.','https://image.tmdb.org/t/p/w500/ueVSPt7vAba0XScHWTDWS5tNxYX.jpg','1931-02-12',7.2,0),(23150,'Swallow','en','Hunter, a newly pregnant housewife, finds herself increasingly compelled to consume dangerous objects. As her husband and his family tighten their control over her life, she must confront the dark secret behind her new obsession.','https://image.tmdb.org/t/p/w500/40Zrwud1EVxNvcjQkotZo7jmr4L.jpg','2020-01-15',6.6,0),(23151,'Insensate','pt','A woman tries to help her twin sister, with whom she has a strong connection, recover from a trauma. But weird things surround their lives.','https://image.tmdb.org/t/p/w500/oYlAnaH1dClevLyKl5hkNqZeKib.jpg','2021-08-04',6.8,0),(23152,'Hostile Territory','en','Former P.O.W. Jack Calgrove moves Heaven and Earth to be reunited with his children following the Civil War. After returning home, Jack discovers that his wife has tragically died and his children, presumed to be orphans, are heading deep into the West on a train crossing enemy lines, with the intent of being placed into new homes. Calgrove and another soldier team up with a troop of Native American sharpshooters and a freed slave as they try to stop the train.','https://image.tmdb.org/t/p/w500/pSgLSxoAG1Dt91dUSwnaKETmseW.jpg','2022-04-22',7.3,0),(23153,'Firefox','en','The Soviets have developed a revolutionary new jet fighter, called \'Firefox\'. Worried that the jet will be used as a first-strike weapon—as there are rumours that it is undetectable by radar—the British send ex-Vietnam War pilot, Mitchell Gant on a covert mission into the Soviet Union to steal the Firefox.','https://image.tmdb.org/t/p/w500/rFIjEbUbsiMwYV0MBGaUTdYlJGa.jpg','1982-06-13',6,0),(23154,'Videodrome','en','As the president of a 