dren. She wants to be intimate but he prefers to be ready for intimacy on Saturdays only, and she gets physically drawn to his artistic brother, Gonzalo/Rohan. Then things get complicated for her after she tests positive for motherhood and finds that her husband may be gay.','https://image.tmdb.org/t/p/w500/bDB9p8z2vzbF6wJzWct0PwfXl4H.jpg','2005-11-04',6.3,0),(23158,'Persona','sv','A young nurse, Alma, is put in charge of Elisabeth Vogler: an actress who is seemingly healthy in all respects, but will not talk. As they spend time together, Alma speaks to Elisabeth constantly, never receiving any answer. The time they spend together only strengthens the crushing realization that one does not exist.','https://image.tmdb.org/t/p/w500/bdXbfUir63TQHA5NTNcXPICZCW8.jpg','1966-10-18',8.3,0),(23159,'Arlo the Alligator Boy','en','Upon learning that he is from New York City, a wide-eyed boy, who is half human and half alligator, decides to leave his sheltered life in the swamp and search for his long lost father. A musical adventure.','https://image.tmdb.org/t/p/w500/oOQMJM7G2W8v2AEK722k8welIJY.jpg','2021-04-16',6.7,0),(23160,'La Belle Verte','fr','As part of an intergalactic coalition, a well-meaning space alien volunteers to bring a message of self-actualization and harmony with nature to the one planet rejected by all her peers as incorrigible: Earth.','https://image.tmdb.org/t/p/w500/vy6J1RJEuQ4W2NZUN8GJKsqKAjW.jpg','1996-09-18',7.2,0),(23161,'Gone in the Night','en','Upon arriving at a remote cabin in the redwoods, Kath and her boyfriend find a mysterious younger couple already there — the rental has apparently been double-booked. They decide to share the cabin with these strangers until the next morning, but her boyfriend disappears with the young woman, which sends Kath in a spiral to find an explanation for their sudden breakup — but the truth is far stranger than she could have imagined.','https://image.tmdb.org/t/p/w500/A1F9RpyLNbYyE9nE4INrVQh0b7T.jpg','2022-07-15',5.