istic murders. The population fears that this is the work of a maniac. During a search a mysterious, hairy creature is observed. This strange appearance is noticed once a month. People lock themselves up at night, but there\'s one boy who\'s still outside, he\'s preparing the barbecue.','https://image.tmdb.org/t/p/w500/52CvWYuJyWcMTPvsfcmsxaVHi7f.jpg','1985-10-10',6.6,0),(23167,'The Santa Clause 2','en','Better watch out! The big guy in red is coming to town once again. This time, Scott Calvin -- also known as Santa Claus -- finds out there\'s an obscure clause in his contract requiring him to take on a wife. He has to leave the North Pole to fulfill his obligations, or else he\'ll be forced to give up his Yuletide gig.','https://image.tmdb.org/t/p/w500/lyfnB5xf3JeVkLQQTz5yZK8Q90C.jpg','2002-10-31',5.9,0),(23168,'Final Fantasy: The Spirits Within','en','Led by a strange dream, scientist Aki Ross struggles to collect the eight spirits in the hope of creating a force powerful enough to protect the planet. With the aid of the Deep Eyes Squadron and her mentor, Dr. Sid, Aki must save the Earth from its darkest hate and unleash the spirits within.','https://image.tmdb.org/t/p/w500/47b1EwFqqSWxYna7NtUM7iML4oT.jpg','2001-07-02',6.2,0),(23169,'Cry-Baby','en','A prim and proper schoolgirl goes against her grandmother\'s wishes when she dates a motorcycle-riding juvenile delinquent.','https://image.tmdb.org/t/p/w500/qV1XYzb2QTvpcnfSnYVSunGQ4XA.jpg','1990-04-05',6.6,0),(23170,'Acrimony','en','A faithful wife takes action when it becomes clear to her that her devious husband has betrayed her.','https://image.tmdb.org/t/p/w500/raz4UTUI5FPkem2j57EXOL75o6I.jpg','2018-03-30',6.8,0),(23171,'Extinction','en','And suddenly, overnight, the world came to a halt. Two men, two survivors, one kid, and hatred that separates them. A place forgotten by everyone, including the creatures that inhabit the Earth... until now.','https://image.tmdb.org/t/p/w500/zwIDreu9pYCqKpv4jomqVM9yX1e.jpg','201