 clarion call to decadent fun, while outside a certain political party grows into a brutal force.','https://image.tmdb.org/t/p/w500/fMhOeJ2TvuY46iYGmsowhgRXfnr.jpg','1972-02-13',7.4,0),(23185,'Fast Times at Ridgemont High','en','Based on the real-life adventures chronicled by Cameron Crowe, Fast Times follows a group of high school students growing up in Southern California. Stacy Hamilton and Mark Ratner are looking for a love interest, and are helped along by their older classmates, Linda Barrett and Mike Damone, respectively. At the center of the film is Jeff Spicoli, a perpetually stoned surfer who faces-off with the resolute Mr. Hand—a man convinced that everyone is on dope.','https://image.tmdb.org/t/p/w500/e15rmfjf0m6EGLe4MnNhwD3Dd1W.jpg','1982-08-13',6.8,0),(23186,'The Changeling','en','After a tragic event happens, composer John Russell moves to Seattle to try to overcome it and build a new and peaceful life in a lonely big house that has been uninhabited for many years. But, soon after, the obscure history of such an old mansion and his own past begin to haunt him.','https://image.tmdb.org/t/p/w500/z4nTYj3JZ5jWAhDgrmEhW2GRAzb.jpg','1980-03-28',7,0),(23187,'Spider-Man: Beyond the Spider-Verse','en','The further continuing story of Miles Morales and the many other Spider-People from different realities.','https://image.tmdb.org/t/p/w500/5cAuJOfd5tuuFBz2yQmBCtVBaj0.jpg','2024-03-27',0,0),(23188,'Urban Legends: Bloody Mary','en','On a prom-night dare, a trio of high school friends chant an incantation, unleashing an evil spirit from the past with deadly consequences.','https://image.tmdb.org/t/p/w500/o3u88kkMezNbgWH3FOgeU8tOGzL.jpg','2005-07-19',4.9,0),(23189,'The Sting','en','A novice con man teams up with an acknowledged master to avenge the murder of a mutual friend by pulling off the ultimate big con and swindling a fortune from a big-time mobster.','https://image.tmdb.org/t/p/w500/fpxhmgeCuPQOeatfeCPwtOwUwlb.jpg','1973-12-25',8,0),(23190,'Assassination Nation','en','High school senior Lily and her friends, Bex, Em and Sarah live in a haze of texts, posts, selfies and chats just like the rest of the world. So, when an anonymous hacker starts posting details from the private lives of everyone in their small town, the result is absolute madness leaving Lily and her friends questioning whether they\'ll live through the night.','https://image.tmdb.org/t/p/w500/dMg1wPakqPx54yMzm0OuHn1jl42.jpg','2018-09-21',6.3,0),(23191,'A Model Kidnapping','en','Grace, an aspiring model, is thrilled to have fashion photographer Hunter Kelly help launch her career. But when Grace is held against her will, Hunter’s true intention to use her as his next “star” on a sexy website is revealed. With courage and resourcefulness, Grace must now find a way to escape before she becomes Hunter’s next model murder victim. Inspired by true events.','https://image.tmdb.org/t/p/w500/dlt68fzUXlTd4VOwmH5uyHps3kT.jpg','2019-07-06',5.9,0),(23192,'Dark Crimes','en','Tadek, a Polish detective, becomes suspicious of a controversial author when the incidents described in his unpublished novel resemble the inner workings of an unsolved murder.','https://image.tmdb.org/t/p/w500/bEwK1r4pmJ9huEjqrZf73NXJvFy.jpg','2016-10-12',4.5,0),(23193,'Power Rangers','en','The Machine Empire defeats the Power Rangers in battle, destroying the Megazord. It is revealed that Earth\'s governments then negotiate a truce with the Machine Empire and the Power Rangers are disbanded.  Years later, Rocky, the second Red Ranger has defected to the Machine Empire, is critical of Zordon\'s use of Power Rangers as child soldiers, and now sports a prosthetic leg. He interrogates a restrained Kimberly, the former Pink Ranger, about the location of Tommy Oliver, the former Green Ranger. He details the fates of the other Rangers in flashback.','https://image.tmdb.org/t/p/w500/yBOMeXHRdrtcu4vJb91ljqHNYup.jpg','2015-02-24',7.1,0),(23194,'Joe Bell','en','The true story of a small town, working class father who embarks on a solo walk across the U.S. to crusade against bullying after his son is tormented in high school for being gay.','https://image.tmdb.org/t/p/w500/9HfQD60w6f6PPkfdiI6ipJSw0bD.jpg','2021-07-23',6.6,0),(23195,'G-Force','en','A team of trained secret agent animals, guinea pigs Darwin, Hurley, Juarez, Blaster, mole Speckles, and fly Mooch takes on a mission for the US government to stop evil Leonard Saber, who plans to destroy the world with household appliances. But the government shuts them down and they are sentenced to a pet shop. Can they escape to defeat the villain and save the world?','https://image.tmdb.org/t/p/w500/jpjG88kTrK7mHnRx4cpLHh8YZwr.jpg','2009-07-24',5.4,0),(23196,'The Reef: Stalked','en','After her sister\'s murder, Nic, her younger sister and two friends seek solace through a Pacific island kayaking adventure. Hours into the trip the women are stalked by a shark and must band together, face their fears and save each other.','https://image.tmdb.org/t/p/w500/zDyoonhhDBGCWCkE5EZt6yqIp4M.jpg','2022-07-14',6.2,0),(23197,'Jay and Silent Bob Reboot','en','Jay and Silent Bob embark on a cross-country mission to stop Hollywood from rebooting a film based on their comic book characters Bluntman and Chronic.','https://image.tmdb.org/t/p/w500/3hLTjzInrHgbcaedjnWNEPOinDi.jpg','2019-10-15',5.6,0),(23198,'88 Minutes','en','A college professor who moonlights as a forensic psychiatrist for the FBI, receives a death threat claiming he has only 88 minutes to live.','https://image.tmdb.org/t/p/w500/8rMiBz8kLMNmQyMbQXL9MPIlyw.jpg','2007-02-14',5.7,0),(23199,'Ronin','en','A briefcase with undisclosed contents – sought by Irish terrorists and the Russian mob – makes its way into criminals\' hands. An Irish liaison assembles a squad of mercenaries, or \'ronin\', and gives them the thorny task of recovering the case.','https://image.tmdb.org/t/p/w500/oVolaz0eIANKuPXhRuX4H5dz0HB.jpg','1998-09-25',6.9,0),(23200,'A Cinderella Story: Starstruck','en','Finley Tremaine, a small-town farm girl, longs to spread her wings and soar as an aspiring performer. When a Hollywood film crew arrives in her sleepy town, she is determined to land a role in the production and capture the attention of handsome lead actor Jackson Stone. Unfortunately, a botched audition forces her to change course. Now, disguised as cowboy “Huck,” Finley finally gets her big break. But can she keep the charade a secret from everyone, including her evil stepmother and devious step-siblings?','https://image.tmdb.org/t/p/w500/vXIqSUpO84PMNt9JclXzCbPBslT.jpg','2021-06-29',7.2,0),(23201,'An Ordinary Man','en','A war criminal in hiding forms a relationship with his only connection to the outside world - his maid.','https://image.tmdb.org/t/p/w500/2u2sidGEx7xpszHVSrQtL402XHU.jpg','2017-10-09',6.4,0),(23202,'Discarnate','en','A neuroscientist\'s obsession with a drug that expands the human mind inadvertently unleashes a deadly supernatural force on his team.','https://image.tmdb.org/t/p/w500/5NAWW7zTG0zhrBfHk0sTy1hQlFb.jpg','2019-02-20',5.4,0),(23203,'13 Sins','en','Drowning in debt as he\'s about to get married, a bright but meek salesman receives a mysterious phone call informing him that he\'s on a hidden-camera game show where he must execute 13 tasks to receive a multi-million dollar cash prize.','https://image.tmdb.org/t/p/w500/x4tC1s6oFG9nEyxVSM0FiIsLea1.jpg','2014-04-11',6.3,0),(23204,'Life of Brian','en','Brian Cohen is an average young Jewish man, but through a series of ridiculous events, he gains a reputation as the Messiah. When he\'s not dodging his followers or being scolded by his shrill mother, the hapless Brian has to contend with the pompous Pontius Pilate and acronym-obsessed members of a separatist movement. Rife with Monty Python\'s signature absurdity, the tale finds Brian\'s life paralleling Biblical lore, albeit with many more laughs.','https://image.tmdb.org/t/p/w500/lSSA64WF0M0BXnjwr2quMh6shCl.jpg','1979-08-17',7.8,0),(23205,'Silence','en','Two Jesuit priests travel to seventeenth century Japan which has, under the Tokugawa shogunate, banned Catholicism and almost all foreign contact.','https://image.tmdb.org/t/p/w500/x5T0cQDYws0xRBVG4Q3wpcrcmax.jpg','2016-12-22',7.1,0),(23206,'Pound of Flesh','en','In China to donate his kidney to his dying niece, former black-ops agent Deacon awakes the day before the operation to find he is the latest victim of organ theft. Stitched up and pissed-off, Deacon descends from his opulent hotel in search of his stolen kidney and carves a blood-soaked path through the darkest corners of the city. The clock is ticking for his niece and with each step he loses blood.','https://image.tmdb.org/t/p/w500/lLxgyIuENnjPLeNIoqwIg3XBwJ1.jpg','2015-05-07',5.8,0),(23207,'August Never Ends','zh','A story revolving around two friends with very different personalities - the no-nonsense and rebellious Weiyang and the idealist \'Princess\' Qiao. When Xiao Qiao met Weiyang, the two easily became close friends. However, Xiao Qiao\'s fiancee Chao Yan can\'t help himself as he falls deeply in love with Weiyang, which crushes Xiao Qiao\'s fairytale love story. Just as the three are entangled in a world of complications, Weiyang makes a surprising decision.','https://image.tmdb.org/t/p/w500/dyCLhu3eDxnwKFS8ByvTg4VHrBb.jpg','2021-04-16',5.5,0),(23208,'K-9','en','The extravagant cop Michael Dooley needs some help to fight a drug dealer who has tried to kill him. A \"friend\" gives him a dog named Jerry Lee (Officer Lewis), who has been trained to smell drugs. With his help, Dooley sets out to put his enemy behind the bars, but Jerry Lee has a personality of his own and works only when he wants to. On the other hand, the dog is quite good at destroying Dooley\'s car, house and sex-life...','https://image.tmdb.org/t/p/w500/21mBNUe0X4WYywe6w5DyihltmAn.jpg','1989-04-28',6.1,0),(23209,'The Wait','fi','The idyllic and secluded Finnish archipelago. The pandemic soars across the world. Elli’s world trembles as her husband’s old friend arrives at the island.','https://image.tmdb.org/t/p/w500/4MxxI4a17DdXNhTvWj2XEM3vpjC.jpg','2022-04-01',6.1,0),(23210,'The Rifleman of the Voroshilov Regiment','ru','A very typical post-Soviet era storyline. A bunch of vagabonds lured an innocent teenage girl to their apartment, offered her a drink, intimidated, then gang raped her. Local cops are incapable to undertake an adequate actions against the scoundrels - prevented by the superior chief of the local police, who is the dad of one of the scumbags. The case is closed. The girl\'s granddad tired of an endless circumlocution decides to take revenge in his own hands.','https://image.tmdb.org/t/p/w500/mDUPockuLcjeh6Sn4wNRt4ZYDRe.jpg','1999-04-19',7.3,0),(23211,'Mommy','fr','A peculiar neighbor offers hope to a recent widow who is struggling to raise a teenager who is unpredictable and, sometimes, violent.','https://image.tmdb.org/t/p/w500/zPLyLO68iiiSF8ASGtmfXGf2EMN.jpg','2014-09-19',8.3,0),(23212,'Mothering Sunday','en','On a warm spring day in 1924, house maid and foundling Jane Fairchild finds herself alone on Mother\'s Day. Her employers, Mr. and Mrs. Niven, are out and she has the rare chance to spend quality time with her secret lover. Paul is the boy from the manor house nearby, Jane\'s long-term love despite the fact that he\'s engaged to be married to another woman, a childhood friend and daughter of his parents\' friends. But events that neither can foresee will change the course of Jane\'s life forever.','https://image.tmdb.org/t/p/w500/unZ7vPgxMTxWrpPGIkAVSqgdryv.jpg','2021-11-12',5.2,0),(23213,'Offering to the Storm','es','Inspector Amaia Salazar confronts the origins of her nightmares as she unfolds the darkest secrets of the Baztan valley. Part 3 in the Baztan Trilogy.','https://image.tmdb.org/t/p/w500/bLZeYC5XBi3SuJFhyNFpAGGneQH.jpg','2020-07-24',6.5,0),(23214,'Barabbas','en','Epic account of the thief Barabbas, who was pardoned for his crimes and spared crucifixion when Pilate offered the Israelites a choice to pardon Barabbas or Jesus. Struggling with his spirituality, Barabbas goes through many ordeals leading him to the gladiatorial arena, where he tries to win his freedom and confront his inner demons, ultimately becoming a follower of the man who was crucified in his place.','https://image.tmdb.org/t/p/w500/8qTylsK58cNc9hP7cQksi65j8JW.jpg','1961-12-23',7,0),(23215,'The Smurfs: A Christmas Carol','en','When Grouchy Smurf behaves badly to everyone and refuses to celebrate Christmas, the Smurfs of Christmas Past, Present and Future teach him to appreciate Christmas.','https://image.tmdb.org/t/p/w500/1gjT65lS29BbclJlmGvtwnT7hya.jpg','2011-12-02',6.8,0),(23216,'Shakespeare in Love','en','Young Shakespeare is forced to stage his latest comedy, \"Romeo and Ethel, the Pirate\'s Daughter,\" before it\'s even written. When a lovely noblewoman auditions for a role, they fall into forbidden love -- and his play finds a new life (and title). As their relationship progresses, Shakespeare\'s comedy soon transforms into tragedy.','https://image.tmdb.org/t/p/w500/iNCTveBiq7jQ4Av4ynWSdWXN6Cc.jpg','1998-01-29',6.9,0),(23217,'The Kitchen','en','The mobster husbands of three 1978 Hell\'s Kitchen housewives are sent to prison by the FBI. Left with little but a sharp ax to grind, the ladies take the Irish mafia\'s matters into their own hands — proving unexpectedly adept at everything from running the rackets to taking out the competition… literally.','https://image.tmdb.org/t/p/w500/l3smhHvnczXg8E2WzysRVKIXSYJ.jpg','2019-08-08',6.2,0),(23218,'Wings of Desire','de','Two angels, Damiel and Cassiel, glide through the streets of Berlin, observing the bustling population, providing invisible rays of hope to the distressed but never interacting with them. When Damiel falls in love with lonely trapeze artist Marion, the angel longs to experience life in the physical world, and finds -- with some words of wisdom from actor Peter Falk -- that it might be possible for him to take human form.','https://image.tmdb.org/t/p/w500/iZQs2vUeCzvS1KfZJ6uYNCGJBBV.jpg','1987-05-17',7.8,0),(23219,'October Sky','en','Based on the true story of Homer Hickam, a coal miner\'s son who was inspired by the first Sputnik launch to take up rocketry against his father\'s wishes, and eventually became a NASA scientist.','https://image.tmdb.org/t/p/w500/vjRSVHAqQo6t7faNVQj3WNSJWUv.jpg','1999-02-19',7.6,0),(23220,'The Unforgiven','en','The neighbors of a frontier family turn on them when it is suspected that their beloved adopted daughter was stolen from the Kiowa tribe.','https://image.tmdb.org/t/p/w500/9085eJIHF1LqoKgGWK74Z3dxXpo.jpg','1960-04-06',6.4,0),(23221,'The Way Way Back','en','Shy 14-year-old Duncan goes on summer vacation with his mother, her overbearing boyfriend, and her boyfriend\'s daughter. Having a rough time fitting in, Duncan finds an unexpected friend in Owen, manager of the Water Wizz water park.','https://image.tmdb.org/t/p/w500/bHoQ0xjDJ5sJZNca7QyFa6ZeXxg.jpg','2013-06-06',7.1,0),(23222,'Billy Madison','en','Billy Madison is the 27 year-old son of Bryan Madison, a very rich man who has made his living in the hotel industry. Billy stands to inherit his father\'s empire, but only if he can make it through all 12 grades, 2 weeks per grade, to prove that he has what it takes to run the family business.','https://image.tmdb.org/t/p/w500/1XV42Zu9taxluIKXMeV9OSpYCSq.jpg','1995-02-10',6.2,0),(23223,'The Marine 2','en','Rebels seize control of the hotel where a Marine sniper and his wife are staying. Can he save the day?','https://image.tmdb.org/t/p/w500/z1PayLY6vlMeCrL6Xz8biuuVkLq.jpg','2009-12-29',6,0),(23224,'The Rocker','en','In the 1980s, a drummer is abandoned by his band just before they become rock superstars. Twenty years later, the drummer sees his second chance at stardom arise when he is asked to perform with his teenage nephew\'s high school rock band.','https://image.tmdb.org/t/p/w500/wzgFC7jOEMtf9D6CSdI7ckUMtwU.jpg','2008-08-20',6,0),(23225,'The Hills Have Eyes','en','On the way to California, a family has the misfortune to have their car break down in an area closed to the public, and inhabited by violent savages ready to attack.','https://image.tmdb.org/t/p/w500/1G2DBIEkoS0JdCiOFIeR3mD8ROE.jpg','1977-07-22',6.2,0),(23226,'The Pagemaster','en','Tyler knows a lot about accidents. So much so, he is scared to do anything that might endanger him, like riding his bike, or climbing into his treehouse. While in an old library, he is mystically transported into the unknown world of books, and he has to try and get home again.','https://image.tmdb.org/t/p/w500/iIWUuCjN8VND7BDugvf45LveA6p.jpg','1994-11-23',6.4,0),(23227,'Volver','es','Raimunda lives and works in Madrid with her husband Paco and their daughter Paula. Raimunda\'s sister Sole lives nearby. The two sisters miss their mother Irene who died several years ago in a house fire along with their father. When a former neighbor from their hometown reports that she has seen the ghost of Irene, the daughters do not believe her. After a murder and a family tragedy, however, Irene\'s spirit materializes around her daughters to comfort them.','https://image.tmdb.org/t/p/w500/pT2GicqmTwsdXTGD7stYrrqWt47.jpg','2006-03-17',7.5,0),(23228,'The Messengers','en','When the Solomons trade in the craziness of big-city life for the quiet of a North Dakota farm, little do they expect the nightmare that follows. Soon after arriving, teenage Jess (Kristen Stewart) and her younger brother see terrifying apparitions and endure attacks from a supernatural source. Jess must warn her disbelieving family before it is too late to save them.','https://image.tmdb.org/t/p/w500/kLmurNcnkmdPahLc6HKQjX3EHed.jpg','2007-02-02',5.7,0),(23229,'The Life Aquatic with Steve Zissou','en','Renowned oceanographer Steve Zissou has sworn vengeance upon the rare shark that devoured a member of his crew. In addition to his regular team, he is joined on his boat by Ned, a man who believes Zissou to be his father, and Jane, a journalist pregnant by a married man. They travel the sea, all too often running into pirates and, perhaps more traumatically, various figures from Zissou\'s past, including his estranged wife, Eleanor.','https://image.tmdb.org/t/p/w500/qZoFLNBC78jzboWeDH6Ha0qavF2.jpg','2004-12-10',7.1,0),(23230,'Don\'t Make Me Go','en','A terminally ill man and his teenage daughter embark on a road trip from California to New Orleans for his 20th college reunion. While there, he secretly hopes she can reunite with the mother who left them long ago.','https://image.tmdb.org/t/p/w500/lUPrLn7g5x0jrPP5pZWMVGlQy2s.jpg','2022-06-13',7.5,0),(23231,'Who Are You People','en','After trying and failing to seduce her teacher, 16-year-old Alex runs away from her boarding school. Trying to seek out the biological father her mother has always kept hidden from her.','https://image.tmdb.org/t/p/w500/tp9mudY9yjmvAzdVbGuqDwJHEDZ.jpg','2023-02-17',0,0),(23232,'The Swarm','fr','A single mother breeds locusts as high-protein foods but has trouble getting them to reproduce until she finds they have a taste for blood.','https://image.tmdb.org/t/p/w500/A734mQnqdLfraDMJ2Ad1lyE8wwP.jpg','2020-10-14',5.8,0),(23233,'The Scary House','de','When a big-city family moves to a remote town, two young brothers and their new friends try to solve the menacing mystery that haunts their home.','https://image.tmdb.org/t/p/w500/1N5KeZaw8bQrt30UaV9qtPLjkwI.jpg','2020-10-30',5.6,0),(23234,'Rose Island','it','In 1968, engineer Giorgio Rosa established the independent state called \"The Isle of Roses\" off the coast of Rimini, built on a platform outside the territorial waters, with Esperanto as the official language. The Italian authorities did not take it well because the micronation was seen as an expedient to not pay taxes on the revenues obtained thanks to the arrival of numerous tourists and curious people.','https://image.tmdb.org/t/p/w500/yePO1PrRfrVMGqwJ3