een footage exploring David Bowie\'s creative and musical journey.','https://image.tmdb.org/t/p/w500/FPir4B7H8a3w63zVYkkod93MRL.jpg','2022-09-15',7.8,0),(23242,'She\'s All That','en','High school hotshot Zach Siler is the envy of his peers. But his popularity declines sharply when his cheerleader girlfriend, Taylor, leaves him for sleazy reality-television star Brock Hudson. Desperate to revive his fading reputation, Siler agrees to a seemingly impossible challenge. He has six weeks to gain the trust of nerdy outcast Laney Boggs -- and help her to become the school\'s next prom queen.','https://image.tmdb.org/t/p/w500/a0pepZNFCjggc7Na9gEwbTI1f46.jpg','1999-01-29',6.3,0),(23243,'Rec','en','An influencer sets up cameras to find out what’s going on in her home.','https://image.tmdb.org/t/p/w500/7pZDYaQSDA0S6RdDYYzhktxeiAa.jpg','2022-12-13',2,0),(23244,'Let It Snow','en','In a small town on Christmas Eve, a snowstorm brings together a group of young people. They soon find their friendships and love lives colliding, and come Christmas morning, nothing will be the same.','https://image.tmdb.org/t/p/w500/rEVu3E1OhMPJeCAn9a6QLyVhZDj.jpg','2019-11-08',6.1,0),(23245,'2036: Nexus Dawn','en','This in-world short film takes place in the year 2036 and revolves around Jared Leto’s character, Niander Wallace. In this short, Wallace introduces a new line of “perfected” replicants called the Nexus 9, seeking to get the prohibition on replicants repealed. This no doubt has serious ramifications that will be crucial to the plot of Blade Runner 2049.','https://image.tmdb.org/t/p/w500/qPci3811kFmPPEevGrnjeKWokD4.jpg','2017-08-30',6.9,0),(23246,'Pieces of a Woman','en','When a young mother\'s home birth ends in unfathomable tragedy, she begins a year-long odyssey of mourning that fractures relationships with loved ones in this deeply personal story of a woman learning to live alongside her loss.','https://image.tmdb.org/t/p/w500/OgUfLlhfBFx5BPK6LzBWFvBW1w.jpg','2020-12-30',7.1,0),(23247,'