colate','th','Zen, an autistic teenage girl with powerful martial arts skills, gets money to pay for her sick mother Zin\'s treatment by seeking out all the people who owe Zin money and making them pay.','https://image.tmdb.org/t/p/w500/g8CBVNFdJOGINQW2KuOvl5NAPS5.jpg','2008-02-06',7.3,0),(23263,'What Lies Beneath','en','When Claire Spencer starts hearing ghostly voices and seeing spooky images, she wonders if an otherworldly spirit is trying to contact her. All the while, her husband tries to reassure her by telling her it\'s all in her head. But as Claire investigates, she discovers that the man she loves might know more than he\'s letting on.','https://image.tmdb.org/t/p/w500/2L3Cn0CizbSy2E9KJt1SiOSyb6p.jpg','2000-07-21',6.4,0),(23264,'Aníkúlápó','en','It tells the story of Saro, a man seeking for greener pasture, but unfolding events and his affair with the king\'s wife, he encounters his untimely death and with Akala, a mystical bird believed to give and take life.','https://image.tmdb.org/t/p/w500/xb30hkUpBm23stnVgDJGYGsC0R0.jpg','2022-09-30',6.8,0),(23265,'Arthur','en','Arthur is a 30-year-old child who will inherit $750 million if he complies with his family\'s demands and marries the woman of their choosing.','https://image.tmdb.org/t/p/w500/l8bPNKEuXJmaxkwVp8JpYiNQJWI.jpg','1981-07-17',6.5,0),(23266,'Wrongfully Accused','en','Ryan Harrison, a violin god, superstar and sex symbol does not want to cheat on sexy Lauren Goodhue\'s husband with her. Mr. Goodhue is found murdered and Ryan suddenly finds himself being the main suspect. After being sentenced to death he manages to flee while being transferred to his execution site. Now, all the world is after him as he stumbles from one unfortunate incident to the next in order to prove himself innocent - by finding a mysterious one-eyed, one-armed, one-legged man...','https://image.tmdb.org/t/p/w500/6FG3aldS4eVD4baKwmAi9P8kdRS.jpg','1998-07-23',5.9,0),(23267,'Return to the 36th Chamber','zh','The workers of a dye factory have their pay cut by 20% when the factory owner brings in some Manchu thugs to try and increase production. Desperate to reclaim their full wages, the workers hire an actor to impersonate a priest and kung-fu expert from the temple of Shaolin. The factory owner proves the actor a fraud, and punishes all those involved. The young actor feels he has let the workers down, and promises to atone. He sets out for Shaolin, determined to be accepted as a kung-fu pupil at the elite temple.','https://image.tmdb.org/t/p/w500/llpg6eSXeD6TOoo5sDQOUZTCtaZ.jpg','1980-08-24',6.7,0),(23268,'The Passengers of the Night','fr','Paris, 1981. The winds of change are blowing on election night and the French storm the streets, elated. But Élisabeth struggles to share the general mood of optimism. Her marriage is coming to an end and she will now have to support her family. She is distraught, and her father and teenage children are worried that her tears simply will not dry. But what if listening to her emotions could help her to start filling the blank page of her future? What if she were to write a letter on a whim to the host of her favourite radio programme? Or invite a homeless girl into her house? What would happen if she were to make the kind of gestures that actually change lives?','https://image.tmdb.org/t/p/w500/t5UGtAsH24q3t9GQpj0A7t9HXY9.jpg','2022-05-04',7.2,0),(23269,'Money Train','en','When a vengeful New York transit cop decides to steal a trainload of subway fares, his foster brother—a fellow cop—tries to protect him.','https://image.tmdb.org/t/p/w500/jWBDz6Mf9aQVBiUS76JQsEhvoJl.jpg','1995-11-21',5.9,0),(23270,'Arthur, Malédiction','fr','Alex is an 18 year old young man. He has been a big fan of the Arthur and the Minimoys fantasy film saga for years. Then his group of friends suggests that he goes to the abandoned house where the film was shot. They are unaware that they are about to fall into a deadly plot.','https://image.tmdb.org/t/p/w500/2MVrHAbbMFXhFmLsVK1Bb