Open Season 3','en','Boog, Elliot, and their forest friends return with an all-new adventure, this time in a Big Top Circus! The comedy begins when Boog\'s pals choose their family obligations over the annual guy\'s trip, and a disappointed Boog decides to take a trip of his own, which leads him right into the middle of a circus ring...literally. When he switches places with a devious look-a-like circus grizzly and falls for an alluring Russian troupe member, he\'ll come to realize that maybe you don\'t have to choose between family and friendship after all.','https://image.tmdb.org/t/p/w500/l31kW9iurz0PLHWN6gglFXcm1sS.jpg','2010-10-21',5.6,0),(23279,'Cinderela Pop','pt','Cintia is modern princess, she\'s connected, decided and loves music. This \"pop\" princess used to live with their parents in a huge castle with a nice view to the city. Every night she looked through the window and watch the view dreaming with a prince she didn\'t met yet. But one day her castle crumbles with everything around her, after her parents divorce she went to live with her aunt and stops believing in love.  What she didn\'t knew was that there was a charming prince in her history, that wanted to break the ice around our modern day cinderella.','https://image.tmdb.org/t/p/w500/uL0TrrV5MHQFkwRxlho0dDKTwvm.jpg','2019-02-28',6.5,0),(23280,'The Intruder','en','A psychological thriller about a young married couple who buys a beautiful Napa Valley house on several acres of land only to find that the man they bought it from refuses to let go of the property.','https://image.tmdb.org/t/p/w500/p9xKyetr0ihJ2K6HJMeXzc4IwEv.jpg','2019-05-03',6.1,0),(23281,'Mank','en','1930s Hollywood is reevaluated through the eyes of scathing social critic and alcoholic screenwriter Herman J. Mankiewicz as he races to finish the screenplay of Citizen Kane.','https://image.tmdb.org/t/p/w500/4yzTcAtvzyZLLto4z04xobUK9el.jpg','2020-11-13',6.8,0),(23282,'A Brighter Summer Day','zh','A boy experiences first love, friendships and injustices growing up in 1960s Taiwan.','https://image.tmdb.org/t/p/w500/3l8fOAwiN3N5n3hHnZ51eog7Zu2.jpg','1991-07-27',8.3,0),(23283,'Water for Elephants','en','In this captivating Depression-era melodrama, impetuous veterinary student Jacob Jankowski joins a celebrated circus as an animal caretaker but faces a wrenching dilemma when he\'s transfixed by angelic married performer Marlena.','https://image.tmdb.org/t/p/w500/8T7Hvb9trKvCAmbSI8cEIU0Sl2T.jpg','2011-04-15',6.9,0),(23284,'Vellari Pattanam','ml','','https://image.tmdb.org/t/p/w500/8LJVUCflkjXVqCvYVkWKDC1M9jk.jpg','2023-02-10',0,0),(23285,'Cockneys vs Zombies','en','A gang of bank robbers team up with the residents of an old people\'s home to try to survive a zombie outbreak.','https://image.tmdb.org/t/p/w500/1F2owdjCH1vnRj5zjAvPeR4bsGl.jpg','2012-08-31',5.7,0),(23286,'Cinderella and the Secret Prince','en','Cinderella discovers a secret that could shake their world: an evil witch turned the prince into a mouse and replaced him with a look-alike. Cinderella and her friends must save the real prince and help him defeat the evil witch.','https://image.tmdb.org/t/p/w500/4oIIM7i4sFPyGFWP0GYZo3pNAH7.jpg','2018-09-30',6.8,0),(23287,'Stargirl','en','Leo Borlock is an average student at Mica High School. He gets decent grades, is a member of the school\'s marching band and has always been content flying under the radar. But all that changes when he meets Stargirl Caraway, a confident and colorful new student with a penchant for the ukulele, who stands out in a crowd. She is kind, finds magic in the mundane and touches the lives of others with the simplest of gestures. Her eccentricities and infectious personality charm Leo and the student body, and she quickly goes from being ignored and ridiculed to accepted and praised, then back again, sending Leo on a rollercoaster ride of emotions.','https://image.tmdb.org/t/p/w500/gwsrtzSrr7G6xjxsa7IwaAMHpEF.jpg','2020-03-10',7.5,0),(23288,'Swimming Pool','en','A British crime novelist travels to her publisher\'s upmarket summer house in Southern France to seek solitude in order to work on her next book. However, the unexpected arrival of the publisher\'s daughter induces complications and a subsequent crime.','https://image.tmdb.org/t/p/w500/bwBAUlEXhUKmegdguoFj9grF9t3.jpg','2003-05-21',6.5,0),(23289,'Analyze This','en','Countless wiseguy films are spoofed in this film that centers on the neuroses and angst of a powerful Mafia racketeer who suffers from panic attacks. When Paul Vitti needs help dealing with his role in the \"family,\" unlucky shrink Dr. Ben Sobel is given just days to resolve Vitti\'s emotional crisis and turn him into a happy, well-adjusted gangster.','https://image.tmdb.org/t/p/w500/eqa4TEgkx63WRhqyD8eTwmL7bUi.jpg','1999-03-05',6.5,0),(23290,'Calibre','en','Two lifelong friends head up to an isolated Scottish Highlands village for a weekend hunting trip that descends into a never-ending nightmare as they attempt to cover up a horrific hunting accident.','https://image.tmdb.org/t/p/w500/gCVOQzV7Z556WnJFNeX7y8BFhyW.jpg','2018-06-22',6.5,0),(23291,'Total Eclipse','en','Young, wild poet Arthur Rimbaud and his mentor Paul Verlaine engage in a fierce, forbidden romance while feeling the effects of a hellish artistic lifestyle.','https://image.tmdb.org/t/p/w500/e0j1zDF3ITeTbGTXFGamosCxT4z.jpg','1995-11-03',6.4,0),(23292,'Stone Cold','en','Jesse Stone is a former L.A. homicide detective who left behind the big city and an ex-wife to become the police chief of the quiet New England fishing town of Paradise. Stone\'s old habits die hard as he continues to indulge his two favorite things: Scotch whiskey and women. After a series of murders—the first ever in Paradise—and a high school girl is raped, he\'s forced to face his own demons in order to solve the crimes.','https://image.tmdb.org/t/p/w500/fpNB84nfYPWDJqaNlGK1qjuITOS.jpg','2005-02-20',7,0),(23293,'All the Places','es','Two siblings who haven\'t seen each other in 