ds, and win the heart of Pink Lady Stephanie?','https://image.tmdb.org/t/p/w500/ufWc8AR5D66lwB2UZvZ9xvGcDSD.jpg','1982-06-11',5.1,0),(23298,'Lullaby','en','A new mother discovers a lullaby in an ancient book and soon regards the song as a blessing. But her world transforms into a nightmare when the lullaby brings forth the ancient demon Lilith.','https://image.tmdb.org/t/p/w500/vmE4gZ9vy8ammgS2UsEh0Z1OCia.jpg','2022-12-16',6.8,0),(23299,'The Last Unicorn','en','From a riddle-speaking butterfly, a unicorn learns that she is supposedly the last of her kind, all the others having been herded away by the Red Bull. The unicorn sets out to discover the truth behind the butterfly\'s words. She is eventually joined on her quest by Schmendrick, a second-rate magician, and Molly Grue, a now middle-aged woman who dreamed all her life of seeing a unicorn. Their journey leads them far from home, all the way to the castle of King Haggard.','https://image.tmdb.org/t/p/w500/2MhDPbadE2ha83qiFwUHPgmKLnV.jpg','1982-11-19',7.2,0),(23300,'Motherless Brooklyn','en','New York City, 1957. Lionel Essrog, a private detective living with Tourette syndrome, tries to solve the murder of his mentor and best friend, armed only with vague clues and the strength of his obsessive mind.','https://image.tmdb.org/t/p/w500/jjMJy5OxJHpFIaboCklDIYdcfpD.jpg','2019-10-31',6.7,0),(23301,'M','de','In this classic German thriller, Hans Beckert, a serial killer who preys on children, becomes the focus of a massive Berlin police manhunt. Beckert\'s heinous crimes are so repellant and disruptive to city life that he is even targeted by others in the seedy underworld network. With both cops and criminals in pursuit, the murderer soon realizes that people are on his trail, sending him into a tense, panicked attempt to escape justice.','https://image.tmdb.org/t/p/w500/slsS6jT6SXjcTPOrsFcLIrHboXA.jpg','1931-05-11',8.1,0),(23302,'Russian Nymphet: Temptation','ru','A Russian teen turns the tables on her fashion photographer. Suddenly he doesn\'t like being the one on camera!','https://image.tmdb.org/t/p/w500/lUL00OVpdxfhjBuuKAulSIzbWgX.jpg','2004-11-28',5.3,0),(23303,'Spontaneous','en','When students in their high school begin inexplicably exploding (literally), seniors Mara and Dylan struggle to survive in a world where each moment may be their last.','https://image.tmdb.org/t/p/w500/2LzYpRuTL3nEos9ZaLfan1u7nbR.jpg','2020-10-02',6.9,0),(23304,'The Legend of Maula Jatt','pa','Maula Jatt, a fierce prizefighter with a tortured past seeks vengeance against his arch nemesis Noori Natt, the most feared warrior in the land of Punjab.','https://image.tmdb.org/t/p/w500/njmYtTRQ9hY35T9mmwrP7NnsNS6.jpg','2022-10-13',7.9,0),(23305,'Mamá o papá','es','Flora and Victor are fun, modern, caring parents. That is, until they decide to get a divorce, and the perfect job opportunity turns up for them. They now have one problem: custody.','https://image.tmdb.org/t/p/w500/yo4aBPuyWh8uB2VHPwK1O7R6WwO.jpg','2021-12-17',7.3,0),(23306,'Alone','en','When an outbreak hits, Aidan barricades himself inside his apartment and starts rationing food. His complex is overrun by infected Screamers, and with the world falling apart into chaos, he is left completely alone fighting for his life.','https://image.tmdb.org/t/p/w500/lkXD1W3pC64KXfZjHhHydd7DvNy.jpg','2020-10-16',5.9,0),(23307,'Mandingo','en','Warren Maxwell, the owner of a run-down plantation, pressures his son, Hammond, to marry and produce an heir to inherit the plantation. Hammond settles on his own cousin, Blanche, but purchases a sex slave when he returns from the honeymoon. Meanwhile, Warren buys a new Mandingo slave named Mede to breed and to earn money as a prize-fighter.','https://image.tmdb.org/t/p/w500/ow4x7Pgx10RDHLD9G6urgq4VDF4.jpg','1975-06-06',6.7,0),(23308,'Promises','fr','Clémence, the fearless mayor of a town near Paris, is completing the final term of her political career. With her faithful right-hand man Yazid, she has long fought for this town plagued by inequality, unemployment and slumlords. However, when Clémence is approached to become Minister, her ambition arises, questioning her devotion and commitment to her citizens. Will her political integrity and election promises survive her newly found ambition?','https://image.tmdb.org/t/p/w500/kO9muUDMi40FpnrqRvkMqCwc5Ac.jpg','2022-01-26',6.5,0),(23309,'Target Number One','en','Ex heroin junkie, Daniel Léger, gets involved in a drug deal with the wrong people for the wrong reasons. When the deal goes sour, Daniel gets thrown into a Thai prison and slapped with a 100-year sentence. While he tries to survive his Bangkok incarceration, the news of his conviction captures the attention of Globe and Mail journalist Victor Malarek, who decides to go after the shady undercover cops responsible for wrongly accusing Daniel.','https://image.tmdb.org/t/p/w500/wb2VpOZTSINPI7jQww0fYCEppcE.jpg','2020-07-10',6.3,0),(23310,'Ad Astra','en','The near future, a time when both hope and hardships drive humanity to look to the stars and beyond. While a mysterious phenomenon menaces to destroy life on planet Earth, astronaut Roy McBride undertakes a mission across the immensity of space and its many perils to uncover the truth about a lost expedition that decades before boldly faced emptiness and silence in search of the unknown.','https://image.tmdb.org/t/p/w500/xBHvZcjRiWyobQ9kxBhO6B2dtRI.jpg','2019-09-17',6.1,0),(23311,'Silk Road','en','Philosophical twenty-something Ross Ulbricht creates Silk Road, a dark net website that sells drugs, while DEA agent Rick Bowden goes undercover to bring him down.','https://image.tmdb.org/t/p/w500/6KxiEWyIDpz1ikmD7nv3GTX4Uoj.jpg','2021-02-19',6.6,0),(23312,'Entourage','en','Movie star Vincent Chase, together with his boys, Eric, Turtle and Johnny, are back…and back in business with super agent-turned-studio head Ari Gold. Some of their ambitions have changed, but the bond between them remains strong as they navigate the capricious and often cutthroat world of Hollywood.','https://image.tmdb.org/t/p/w500/28dqsx1jCxhR05DfH35ui13ywNZ.jpg','2015-06-03',6.2,0),(23313,'Blues Brothers 2000','en','Finally released from prison, Elwood Blues is once again enlisted by Sister Mary Stigmata in her latest crusade to raise funds for a children\'s hospital. Hitting the road to re-unite the band and win the big prize at the New Orleans Battle of the Bands, Elwood is pursued cross-country by the cops.','https://image.tmdb.org/t/p/w500/nCoY8UK2x4DWpICipL40Hg4cDmO.jpg','1998-02-05',5.4,0),(23314,'U Get What U Kiss 3','ro','During the pandemic, Bică and Horică are tying to help their brother to kiss a girl according to the traditional festival for good luck. But the festival is cancelled due to the pandemic and things are getting more and more complicated when a French girl will do anything she can to prevent the brothers from helping him.','https://image.tmdb.org/t/p/w500/fdNYFzMGHBvbK9AdkIIWRSf0aBL.jpg','2023-02-10',0,0),(23315,'Break','ru','The company of three guys and two girls makes their way to the old funicular to have an unforgettable New Year’s Eve celebration at the top of the mountain. A fun adventure turns into a nightmare when the funicular stops over the abyss. Coldness, height and fear of a slow death make them reveal their true essence and get in a fight with each other.','https://image.tmdb.org/t/p/w500/66OBBkqi9v5txzDPLzGULqVeB30.jpg','2019-02-14',5.6,0),(23316,'Of Mice and Men','en','Two drifters, one a gentle but slow giant, try to make money working the fields during the Depression so they can fulfill their dreams.','https://image.tmdb.org/t/p/w500/t8k4c4xbNbKgMWz2JbBQKYd2OHe.jpg','1992-09-16',7.3,0),(23317,'My Name Is Nobody','it','Jack Beauregard, an ageing gunman of the Old West, only wants to retire in peace and move to Europe. But a young gunfighter, known as \"Nobody\", who idolizes Beauregard, wants him to go out in a blaze of glory. So he arranges for Jack to face the 150-man gang known as The Wild Bunch and earn his place in history.','https://image.tmdb.org/t/p/w500/tJQEVI1p00Jh9TUgNEI623iu7ST.jpg','1973-12-13',7.3,0),(23318,'Fire of Love','en','A doomed love triangle between intrepid French scientists Katia and Maurice Krafft, and their beloved volcanoes.','https://image.tmdb.org/t/p/w500/9smEX8UP84yb2GisLwyAyQKvCWS.jpg','2022-07-06',7.2,0),(23319,'The Wedding Singer','en','Robbie, a local rock star turned wedding singer, is dumped on the day of his wedding. Meanwhile, waitress Julia finally sets a wedding date with her fiancée Glenn. When Julia and Robbie meet and hit it off, they find that things are more complicated than anybody thought.','https://image.tmdb.org/t/p/w500/zVvyTrcZQb7kC2DPDzyo25WcxXp.jpg','1998-02-13',6.8,0),(23320,'Savage Grace','en','This examination of a famous scandal from the 1970s explores the relationship between Barbara Baekeland and her only son, Antony. Barbara, a lonely social climber unhappily married to the wealthy but remote plastics heir Brooks Baekeland, dotes on Antony, who is homosexual. As Barbara tries to \"cure\" Antony of his sexuality -- sometimes by seducing him herself -- the groundwork is laid for a murderous tragedy.','https://image.tmdb.org/t/p/w500/z83ExVvReRTMuwxRqatzUaHwIYR.jpg','2007-05-18',5.7,0),(23321,'Sexy Night Report n. 2','it','Version of \"Emanuelle and the Porno Nights,\" from the prior year, re-cut and re-edited by D\'Amato and with Ajita Wilson as the presenter.','https://image.tmdb.org/t/p/w500/suhTN0zqBdbpYtZY1qvCG5Hhjdz.jpg','1978-04-20',6.6,0),(23322,'Day of the Dead','en','When a small Colorado town is overrun by the flesh hungry dead, a small group of survivors try to escape in a last ditch effort to stay alive.','https://image.tmdb.org/t/p/w500/cbXPsWuQykgaRy9lsIfxRszRUXg.jpg','2008-04-08',5.2,0),(23323,'The Collector','en','Desperate to repay his debt to his ex-wife, an ex-con plots a heist at his new employer\'s country home, unaware that a second criminal has also targeted 