ncerned about her young son\'s disturbing behavior thinks something supernatural may be affecting him.','https://image.tmdb.org/t/p/w500/yyejodyk3lWncVjVhhrEkPctY9o.jpg','2019-02-06',6.1,0),(23331,'The Saint','en','International master thief, Simon Templar, also known as The Saint, is asked by a desperate rich man to find his kidnapped daughter. However, in addition to evading the authorities, Simon must face a dangerous adversary from his past.','https://image.tmdb.org/t/p/w500/n8tsrPLem70exhXHfSausV7FlPx.jpg','2017-07-11',5.3,0),(23332,'K-PAX','en','Prot is a patient at a mental hospital who claims to be from a far away planet. His psychiatrist tries to help him, only to begin to doubt his own explanations.','https://image.tmdb.org/t/p/w500/vzZXfF69NsBC4HM5xmRcVQBnF8Z.jpg','2001-10-22',7.2,0),(23333,'Christmas on Mistletoe Farm','en','After inheriting a farm at Christmas time, a widowed father makes a bumpy adjustment to village life — while his kids hatch a plan to stay there forever.','https://image.tmdb.org/t/p/w500/rGCwI76dylPViDF9VXFY0ORRhls.jpg','2022-11-23',5.3,0),(23334,'Timeline','en','A group of archaeological students become trapped in the past when they go there to retrieve their professor. The group must survive in 14th century France long enough to be rescued.','https://image.tmdb.org/t/p/w500/uOCIrFOT4U9QXML3SLlpCxGs7BV.jpg','2003-11-26',5.7,0),(23335,'Hairspray','en','Pleasantly plump teenager Tracy Turnblad auditions to be on Baltimore\'s most popular dance show - The Corny Collins Show - and lands a prime spot. Through her newfound fame, she becomes determined to help her friends and end the racial segregation that has been a staple of the show.','https://image.tmdb.org/t/p/w500/g1yQLFeAo7ZNdCPY1F7yytnn2UP.jpg','2007-07-19',6.7,0),(23336,'Rendel','fi','Rendel, a masked superhero, becomes blinded by his desire for revenge against a sinister criminal organization.','https://image.tmdb.org/t/p/w500/9TTRFp7OpMEv3xDuUAU4m5d6tHq.jpg','2017-09-22',5.4,0),(23337,'Ip Man','cn','A semi-biographical account of Yip Man, the first martial arts master to teach the Chinese martial art of Wing Chun. The film focuses on events surrounding Ip that took place in the city of Foshan between the 1930s to 1940s during the Second Sino-Japanese War. Directed by Wilson Yip, the film stars Donnie Yen in the lead role, and features fight choreography by Sammo Hung.','https://image.tmdb.org/t/p/w500/ggTTUXZg7trvAhsVj3eyd65bAnh.jpg','2008-12-12',7.7,0),(23338,'The Secret: Dare to Dream','en','A widow with three children hires a handyman to fix her house during a major storm. When not doing home repairs, he shares his philosophy of believing in the power of the universe to deliver what we want.','https://image.tmdb.org/t/p/w500/5mCqEeBA0MW7H6akFrFQXJu68rU.jpg','2020-04-16',7.3,0),(23339,'Radioactive','en','The story of Nobel Prize winner Marie Curie and her extraordinary scientific discoveries—through the prism of her marriage to husband Pierre—and the seismic and transformative effects their discovery of radium had on the 20th century.','https://image.tmdb.org/t/p/w500/akHIQu8W3rOgT28r25ggXaKcQIr.jpg','2020-03-11',6.6,0),(23340,'The Last Warrior','ru','A new era is about to begin in Eastern Europe. Scythians, the proud warriors, are all but gone and most of the few remaining descendants have become ruthless mercenary assassins. Lutobor, a warrior who becomes involved in intertribal conflicts, sets off on a perilous journey to save his family guided by a captive Scythian.','https://image.tmdb.org/t/p/w500/tI1BO7YUGUBFlTnVGZN0wPnC4YK.jpg','2018-01-18',6,0),(23341,'The Invisible Guardian','es','When the naked body of a teenage girl is found on the banks of the River Baztán, it is quickly linked to a similar murder one month before. Soon, rumours are flying in the nearby village of Elizondo. Is this the work of a ritualistic killer or is it the basajaun, the ‘invisible guardian’ of Basque mythology?  Inspector Amaia Salazar leads the investigation, taking her back to the heart of the Basque country where she was born, and where she hoped never to return. Shrouded in mist and surrounded by impenetrable forests, it is a place of unresolved conflicts and a terrible secret from Amaia’s childhood that will come back to haunt her.  Faced with the superstitions of the village, Amaia must fight the demons of her past to confront the reality of a serial killer on the loose. But as she is drawn deeper into the investigation, she feels the presence of something darker lurking in the shadows…','https://image.tmdb.org/t/p/w500/uxR7CqLRdQ2QuOPP9ymunPrRBCq.jpg','2017-03-03',6.5,0),(23342,'A Room with a View','en','When Lucy Honeychurch and chaperon Charlotte Bartlett find themselves in Florence with rooms without views, fellow guests Mr Emerson and son George step in to remedy the situation. Meeting the Emersons could change Lucy\'s life forever but, once back in England, how will her experiences in Tuscany affect her marriage plans?','https://image.tmdb.org/t/p/w500/5xRAqywVo6tNUNQbAESGVP930la.jpg','1985-12-13',7,0),(23343,'Little Lips','it','A writer returns home to his estate after service in World War I. He has developed a very bad case of depression due to a war wound concerning his genitalia. He contemplates suicide, but recovers after becoming interested in his caretaker\'s 12 year-old war orphan niece, who now lives in the manor.','https://image.tmdb.org/t/p/w500/xHkb0AUaQwrcNPsE2Q1tjRpcEv.jpg','1978-02-08',5.4,0),(23344,'Good People','en','Tom and Anna Wright, a young American couple, fall into severe debt while renovating Anna\'s family home in London. As the couple faces the loss of their dream to have a house and start a family, they discover that the tenant in the apartment below them is dead, and he\'s left behind a stash of cash—$400,000 worth. Though initially hesitant, Tom and Anna decide that the plan is simple: all they have to do is quietly take the money and use only what\'s necessary to get them out of debt. But when they start spending the money and can\'t seem to stop, they find themselves the target of a deadly adversary—the thief who stole it—and that\'s when very bad things start happening to good people.','https://image.tmdb.org/t/p/w500/zNhzWvhOJ18Twl5oKanVWT7bcSk.jpg','2014-08-12',5.5,0),(23345,'Just My Luck','en','Manhattanite Ashley is known to many as the luckiest woman around. After a chance encounter with a down-and-out young man, however, she realizes that she\'s swapped her fortune for his.','https://image.tmdb.org/t/p/w500/wWpqG3zrrPZhvNLflYJdbW1NgY3.jpg','2006-05-12',6.1,0),(23346,'Stargate: Continuum','en','Ba\'al travels back in time and prevents the Stargate program from being started. SG-1 must somehow restore history.','https://image.tmdb.org/t/p/w500/aP22JTw7or68WwqwFu1Bwrg66Ev.jpg','2008-07-29',7.1,0),(23347,'A Hard Day\'s Night','en','Capturing John Lennon, Paul McCartney, George Harrison and Ringo Starr in their electrifying element, \'A Hard Day\'s Night\' is a wildly irreverent journey through this pastiche of a day in the life of The Beatles during 1964. The band have to use all their guile and wit to avoid the pursuing fans and press to reach their scheduled television performance, in spite of Paul\'s troublemaking grandfather and Ringo\'s arrest.','https://image.tmdb.org/t/p/w500/p0kHz7m64wDzvPLmkUl36pN2IHP.jpg','1964-07-07',7.4,0),(23348,'Curious George 2: Follow That Monkey!','en','The film chronicles George\'s adventures as he befriends Kayla, a baby elephant, at a magic circus show and helps her travel across the country to be reunited with her family.Accompanied by his friend, the Man with the Yellow Hat, George travels by foot, train, and truck to reach Kayla\'s brother and sister in California, only to be accused of elephant-napping and brought all the way back to New York.','https://image.tmdb.org/t/p/w500/1jkSEqOvp3CnA3UzWrT56cu7yLR.jpg','2009-08-07',6.6,0),(23349,'Creepshow 3','en','This follow-up to the George Romero/Stephen King-launched anthology series features five new tales of horror and a wraparound. The main stories deal with alternative realities (\"Alice\"), possessed communication devices (\"The Radio\"), vampires and serial killers in lust (\"Call Girl\"), mad inventors (\"The Professor\'s Wife\"), and hauntings from beyond the grave (\"Haunted Dog\").','https://image.tmdb.org/t/p/w500/qvJSdbruD4e5cUxruoUFUkJrsqt.jpg','2006-04-24',4.7,0),(23350,'The Hunchback of Notre Dame','fr','Paris, 1482. Today is the festival of the fools, taking place like each year in the square outside Cathedral Notre Dame. Among jugglers and other entertainers, Esmeralda, a sensuous gypsy, performs a bewitching dance in front of delighted spectators. From up in a tower of the cathedral, Frollo, an alchemist, gazes at her lustfully. Later in the night, Frollo orders Quasimodo, the deformed bell ringer and his faithful servant, to kidnap Esmeralda. But when the ugly freak comes close to her is touched by the young woman\'s beauty...','https://image.tmdb.org/t/p/w500/ds4pCq0GOEarBHI35bYSN2PC0KQ.jpg','1956-12-19',6.6,0),(23351,'Altered States','en','A research scientist explores the boundaries and frontiers of consciousness. Using sensory deprivation and hallucinogenic mixtures from native American shamans, he explores these altered states of consciousness and finds that memory, time, and perhaps reality itself are states of mind.','https://image.tmdb.org/t/p/w500/8BATrghiOSFOtcpg2j2hZSHm6pm.jpg','1980-12-25',6.7,0),(23352,'Rent','en','This rock opera tells the story of one year in the life of a group of bohemians struggling in late 1980s East Village, New York, USA. The film centers around Mark and Roger, two roommates. While a  tragedy has made Roger numb to new experiences, Mark begins capturing their world through his attempts to make a personal movie. In the year that follows, they and their friends deal with love, loss, and working together.','https://image.tmdb.org/t/p/w500/fomBrfOHWxlaVcjPk4yCQgIwAnh.jpg','2005-11-17',6.8,0),(23353,'Seraphim Falls','en','The Civil War has ended, but Colonel Morsman Carver is on one final mission – to kill Gideon, no matter what it takes. Launched by a gunshot and propelled by rage, the relentless pursuit takes the two men through frigid snow-capped mountains and arid deserts, far from the comforts and codes of civilisation, into the bloodiest recesses of their own souls.','https://image.tmdb.org/t/p/w500/3WCcrCYq9mCyFGLpgx2IwhpURTe.jpg','2006-09-13',6.4,0),(23354,'Angel Heart','zh','Having spent a harrowing time in prison, Miao Wei looks up both former, casual lovers but also his childhood sweetheart Wennie. It\'s not long until they\'re married and off on a perfect path together but Miao Wei takes scars from his prison time into his intimate moments with Wennie. Claiming he loves her too much, the relationship begins falling apart in dangerous ways...','https://image.tmdb.org/t/p/w500/zs2VavwylNDFVuD9EpHyO72Fga8.jpg','1995-05-25',3.7,0),(23355,'Unstable Fables: 3 Pigs & a Baby','en','When the three pigs find a tiny wolf cub on their doorstep, they decide to raise him as their own, unaware that they\'ve played right into the plan of a special-ops team of wolves. As the newest addition to their family, Lucky grows into his teens not knowing his history, his role in the wolves\' plan or the difficult choice he will have to make about the family that raised him.','https://image.tmdb.org/t/p/w500/8dOUG1hwNDhqIYqwPp82DGuari2.jpg','2008-01-01',6.1,0),(23356,'Blue Jasmine','en','After experiencing a traumatic misfortune, Jasmine French, a wealthy woman from New York, moves to San Francisco to live with her foster sister Ginger and the firm purpose of getting a new life, but she will be haunted by anxiety and memories of the past.','https://image.tmdb.org/t/p/w500/zLdLiUJfueZBctdv8OvkmGXEHEC.jpg','2013-08-01',7,0),(23357,'Body Snatchers','en','When Environmental Protection Agency inspector Steve Malone travels to a remote military base in order to check for toxic materials, he brings his family along for the ride. After arriving at the base, his teenage daughter Marti befriends Jean Platt, daughter of the base\'s commander, General Platt. When people at the base begin acting strangely, Marti becomes convinced that they are slowly being replaced by plant-like aliens.','https://image.tmdb.org/t/p/w500/s8WdtuOBvfEsuPtbQVpNfEgd5aR.jpg','1993-06-09',6.1,0),(23358,'Repo Men','en','In the future, medical technology has advanced to the point where people can buy artificial organs to extend their lives. But if they default on payments, an organization known as the Union sends agents to repossess the organs. Remy is one of the best agents in the business, but when he becomes the recipient of an artificial heart, he finds himself in the same dire straits as his many victims.','https://image.tmdb.org/t/p/w500/briDKf5nrLzox2zcI6pquKeqWz8.jpg','2010-03-18',6.3,0),(23359,'Westworld','en','A robot malfunction creates havoc and terror for unsuspecting vacationers at a futuristic, adult-themed amusement park.','https://image.tmdb.org/t/p/w500/qNt29HzxwZ4jGTgSRxdA34ino9Q.jpg','1973-08-15',6.7,0),(23360,'Alpha and Omega','en','Two young wolves at opposite ends of their pack\'s social order are thrown together into a foreign land and need each other to return home, but love complicates everything.','https://image.tmdb.org/t/p/w500/7YVyH5sS6kLQRsSDF5dhhR0BWeh.jpg','2010-09-17',5.9,0),(23361,'Layer Cake','en','When a seemingly straight-forward drug deal goes awry, XXXX has to break his die-hard rules and turn up the heat, not only to outwit the old regime and come out on top, but to save his own skin...','https://image.tmdb.org/t/p/w500/rDOxXteqxALBaSa3V3zTjGJuyWB.jpg','2004-09-30',6.9,0),(23362,'Jackass 3D','en','Johnny Knoxville, Bam Margera, Steve-O, Wee Man and the rest of their fearless and foolhardy friends take part in another round of outrageous pranks and stunts. In addition to standing in the 