 by the Japanese at Unit 731, the secret biological weapons experimentation unit of the Imperial Japanese Army during World War II. The film details the various cruel medical experiments Unit 731 inflicted upon the Chinese and Soviet prisoners at the tail-end of the war.','https://image.tmdb.org/t/p/w500/7GXtPuJ5wcrJNqPwwmvZIForY0C.jpg','1988-12-01',6.2,0),(23369,'Runaway Jury','en','A juror on the inside and a woman on the outside manipulate a court trial involving a major gun manufacturer.','https://image.tmdb.org/t/p/w500/g58RA1zzE39KnkRpKRfgA5RxoXP.jpg','2003-01-16',6.9,0),(23370,'Paths of Glory','en','A commanding officer defends three scapegoats on trial for a failed offensive that occurred within the French Army in 1916.','https://image.tmdb.org/t/p/w500/l2IY0gOHHmCWM90LjteFssxIV1G.jpg','1957-10-25',8.3,0),(23371,'The Sitter','en','Noah, is not your typical entertain-the-kids-no-matter-how-boring-it-is kind of sitter. He\'s reluctant to take a sitting gig; he\'d rather, well, be doing anything else, especially if it involves slacking. When Noah is watching the neighbor\'s kid he gets a booty call from his girlfriend in the city. To hook up with her, Noah takes to the streets, but his urban adventure spins out of control as he finds himself on the run from a maniacal drug lord.','https://image.tmdb.org/t/p/w500/aL8uNRfhN4Xl0kzwk102CFGyySH.jpg','2011-12-09',5.6,0),(23372,'SPL: Kill Zone','zh','Chan, an articulate senior detective nearing the end of his career, is taking care of the daughter of a witness killed by ruthless crime lord Po. Martial arts expert Ma is set to take over as head of the crime unit, replacing Chan who wants an early retirement.','https://image.tmdb.org/t/p/w500/9Zv5ekjWAKbFhz0VlzQVVcXTWCq.jpg','2005-11-18',6.9,0),(23373,'Kiss of the Dragon','en','Liu Jian, an elite Chinese police officer, comes to Paris to arrest a Chinese drug lord. When Jian is betrayed by a French officer and framed for murder, he must go into hiding and find new allies.','https://image.tmdb.org/t/p/w500/A1GrGdX4AgCRDweg9X3x8JsZrEc.jpg','2001-07-06',6.8,0),(23374,'Kramer vs. Kramer','en','Ted Kramer is a career man for whom his work comes before his family. His wife Joanna cannot take this anymore, so she decides to leave him. Ted is now faced with the tasks of housekeeping and taking care of himself and their young son Billy.','https://image.tmdb.org/t/p/w500/6IVQjDTbr7pXx2AR8jovbYwpyiF.jpg','1979-12-07',7.6,0),(23375,'Blueback','en','Based on the best-selling novel by Tim Winton, Blueback is a timely tale about the ocean, a beautiful marine creature, and a young girl’s power to change the world.','https://image.tmdb.org/t/p/w500/5cWXJJsPRuz85zAK7XXmu9Vfdu2.jpg','2022-12-29',5.5,0),(23376,'Once Upon a Time in China','cn','Set in late 19th century Canton, this martial arts film depicts the stance taken by the legendary martial arts hero Wong Fei-Hung against foreign forces\' plundering of China.','https://image.tmdb.org/t/p/w500/z0ATIuW043A0CljK0xKb94WxQEV.jpg','1991-08-15',7.2,0),(23377,'Little Monsters','en','A washed-up musician teams up with a teacher and a kids show personality to protect young children from a sudden outbreak of zombies.','https://image.tmdb.org/t/p/w500/oQvUq7UmumBTcAnvgFLFvegY47d.jpg','2019-08-29',6.6,0),(23378,'After','en','When two bus crash survivors awake to discover that they are the only people left in their small town, they must form an unlikely alliance in a race to unravel the truth behind their isolation. As strange events begin to unfold, they start to question whether the town they know so well is really what it seems.','https://image.tmdb.org/t/p/w500/5AKcsJYztbcX2KsyCXtKucyUUMA.jpg','2012-08-27',5.6,0),(23379,'The Other Side','sv','A dad moves into a new house with his son and girlfriend. When he\'s out of town working, the son makes a new \"friend\" next doors.','https://image.tmdb.org/t/p/w500/tFZI9YHElePikKqhJ26sBASempW.jpg','2020-10-23',6.3,0),(23380,'Let Him Go','en','Following the loss 