rbed eco-system that has produced a new species, they hire the best American team of underwater cave explorers in the world. While exploring deeper into the underwater caves, a rockslide blocks their exit, and they soon discover a larger carnivorous creature has added them to its food chain.','https://image.tmdb.org/t/p/w500/gMfJo22XulGLA8h8yAjiLhdQusv.jpg','2005-08-26',5.3,0),(23389,'V/H/S: Viral','en','V/H/S: VIRAL\'s segments include the story of a deranged illusionist who obtains a magical object of great power; a homemade machine that opens a door to a parallel world; teenage skaters that unwillingly become targets of a Mexican death cult ritual; and a sinister, shadowy organization that is tracking a serial killer. The segments are tied together by the story of a group of fame-obsessed teens following a violent car chase in LA that unwittingly become stars of the next internet sensation.','https://image.tmdb.org/t/p/w500/vgq9eyUMDWDugp5ZvS5UuvTCQKN.jpg','2014-10-23',4.9,0),(23390,'Problem Child','en','Ben Healy and his social climbing wife Flo adopt fun-loving seven year old Junior. But they soon discover he\'s a little monster as he turns a camping trip, a birthday party and even a baseball game into comic nightmares.','https://image.tmdb.org/t/p/w500/me4kJXgZebuz1doS8y4oW8XUAly.jpg','1990-07-27',6,0),(23391,'Benji','en','Two school kids strike up a friendship with an orphaned puppy named Benji. When danger befalls them and they end up kidnapped by robbers who are in over their heads, Benji and his scruffy sidekick come to the rescue.','https://image.tmdb.org/t/p/w500/79pacM3h5FoETnfuRC6O2qPfzn4.jpg','2018-03-16',6.9,0),(23392,'The Marine 6: Close Quarters','en','Jake Carter and another former Marine, Luke Trapper,  join forces to rescue a young kidnapped girl from a gang of international criminals.','https://image.tmdb.org/t/p/w500/ApPQa5MVbHkVXNKrXHpHSXd1puu.jpg','2018-11-02',6.9,0),(23393,'99 Homes','en','After his family is evicted from their home, proud and desperate construction worker Dennis Nash tries to win his home back by striking a deal with the devil and working for Rick Carver, the corrupt real estate broker who evicted him.','https://image.tmdb.org/t/p/w500/gD2DRIAOCIszyHlrYYbUXjsHHlr.jpg','2015-09-25',6.8,0),(23394,'Letters from Iwo Jima','en','The story of the battle of Iwo Jima between the United States and Imperial Japan during World War II, as told from the perspective of the Japanese who fought it.','https://image.tmdb.org/t/p/w500/kZokxQtzMPURvijWYFuvh1fAvnv.jpg','2006-12-19',7.5,0),(23395,'LEGO Monkie Kid: A Hero Is Born','en','Monkey King comes to life as a young boy named MK, obsessed with the legends of old, discovers Monkey King\'s magical staff. After witnessing Red Son and Princess Iron Fan release the Demon Bull King from his prison under the mountain, MK accidentally grabs Monkey King’s magical staff and escapes, sending him on a journey to return the staff to Monkey King in order for him to save the day.','https://image.tmdb.org/t/p/w500/3LDHJRNu7er4QH1EJsFLuUmhOWB.jpg','2020-06-13',6.2,0),(23396,'The Prince & Me: A Royal Honeymoon','en','At last! The newly crowned King of Denmark, Edward, and his wife and Queen, Dr. Paige Morgan, find time to fly to Belavia for their secret honeymoon. What better way to spend the Christmas holidays than at a fabulous ski resort? But as they take a tour of Belavia\'s natural beauty, Eddie and Paige discover that the evil Prime Minister Polonius has given orders to bulldoze the precious forests - to drill for oil. Then, the couple bump into Paige\'s ex-boyfriend, Scott. Eddie immediately becomes jealous - furthermore he suspects Scott cannot be trusted. Paige and Eddie must do everything they can to save the forest, even if it means putting aside their honeymoon.','https://image.tmdb.org/t/p/w500/25I6X1Y9opO6NGTqftVKbeQ3OoX.jpg','2008-10-28',5.5,0),(23397,'Pushing Tin','en','Two air traffic controllers who thrive on living dangerously compete to outdo each other on several levels.','https://image.tmdb.org/t/p/w500/61FWajJNKeS27DO4KgvS5LUgcHh.jpg','1999-04-23',5.8,0),(23398,'Aqua Teen Forever: Plantasm','en','Everyone’s favorite rascals, the Aqua Teens, and everyone’s favorite perverted neighbor, Carl, split up then get back together to fight everyone’s favorite corporate overlord, Amazin, led by everyone’s favorite tech mogul, Neil, and his trusty scientist sidekick, Elmer.','https://image.tmdb.org/t/p/w500/dzMfgDxEOfFdw6WIaoC94CayYWL.jpg','2022-10-06',6.3,0),(23399,'Dark Water','en','Dahlia Williams and her daughter Cecelia move into a rundown apartment on New York\'s Roosevelt Island. She is currently in midst of divorce proceedings and the apartment, though near an excellent school for her daughter, is all she can afford. From the time she arrives, there are mysterious occurrences and there is a constant drip from the ceiling in her daughter\'s bedroom.','https://image.tmdb.org/t/p/w500/cm4M9xaBu78IjuAVNG4LCXdXsg.jpg','2005-07-08',5.6,0),(23400,'I Spit on Your Grave: Déjà Vu','en','Following her rape, Jennifer Hills wrote a bestselling account of her ordeal and of the controversial trial in which she was accused of taking the law into her own hands and brutally killing her assailants. In the small town where the rape and revenge took place, the relatives of the rapists she killed are furious that the court declared her not guilty and resolve to take justice into their own hands.','https://image.tmdb.org/t/p/w500/hrD8fU6tA1Pzh4ybxG4iN5TbVdU.jpg','2019-04-23',3,0),(23401,'Vengeance: A Love Story','en','When a new friend is brutally assaulted, Detective John Droomor is put by chance in charge of the investigation. Although the evidence against the perpetrators seems overwhelming, there is nothing definitive in the case that guarantees justice is served, even more so if some people are willing to twist and betray it.','https://image.tmdb.org/t/p/w500/kPUFcGPI9FChybFHIJJBZZLiIlg.jpg','2017-03-16',5.6,0),(23402,'House of the Dead 2','en','In Guesta Verde University, the deranged Professor Curien is trying to bring back the dead, killing students for the experiment. There is an outbreak of zombies in the campus, and the government sends a NSA medical research team, formed by Dr. Alexandra Morgan a.k.a. Nightingale and lieutenant Ellis, with a special force leaded by lieutenant Dalton, trying to get the zero sample from the first generation zombie. The team has a very short time to accomplish their mission and leave the place before missiles are sent to destroy the area. However, the place is crowded of hyper sapiens and the group has to fight to survive.','https://image.tmdb.org/t/p/w500/r95UYIFeCjIVKZ1MPxZwEHITAhg.jpg','2006-02-11',4.7,0),(23403,'Third Person','en','An acclaimed novelist struggles to write an analysis of love in one of three stories, each set in a different city, that detail the beginning, middle and end of a relationship.','https://image.tmdb.org/t/p/w500/8HfxGEbQnPvIzaYAHMvu947r8sQ.jpg','2013-09-09',5.9,0),(23404,'Lady Macbeth','en','Rural England, 1865. Katherine, suffocated by her loveless marriage to a bitter man and restrained by his father\'s tyranny, unleashes an irresistible force within her, so powerful that she will stop at nothing to get what she wants.','https://image.tmdb.org/t/p/w500/xWTJbhTwSTJmhLlX5xAOxPhdnXc.jpg','2017-04-28',6.6,0),(23405,'Tom and Jerry: Willy Wonka and the Chocolate Factory','en','The classic Roald Dahl tale gets a modern twist when Tom and Jerry enter the amazing world of Willy Wonka\'s Chocolate Factory.','https://image.tmdb.org/t/p/w500/vh5iYhj80l1inSdep61sF8g1S8m.jpg','2017-06-28',6.6,0),(23406,'Close My Eyes','en','After some years of tension, Richard begins a sexual relationship with his sister Natalie. Now married, the relationship proves dangerously obsessional.','https://image.tmdb.org/t/p/w500/HVMvJ3TzjbNOqlOILZWPkfZXt0.jpg','1991-11-22',6.1,0),(23407,'Takers','en','A seasoned team of bank robbers, including Gordon Jennings, John Rahway, A.J., and brothers Jake and Jesse Attica successfully complete their latest heist and lead a life of luxury while planning their next job. When Ghost, a former member of their team, is released from prison he convinces the group to strike an armored car carrying $20 million. As the \"Takers\" carefully plot out their strategy and draw nearer to exacting the grand heist, a reckless police officer inches closer to apprehending the criminals.','https://image.tmdb.org/t/p/w500/2It3pUKN9EdG1bIzfvKJccd0gW8.jpg','2010-08-26',6.2,0),(23408,'Alex Cross','en','After Washington DC detective Alex Cross is told that a family member has been murdered, he vows to track down the killer. He soon discovers that she was not his first victim and that things are not what they seem.','https://image.tmdb.org/t/p/w500/bQYXid9o6nunJBgmmjo6JFIQe1p.jpg','2012-10-18',5.2,0),(23409,'The Three Deaths of Marisela Escobedo','es','Follows a mother\'s tireless crusade to jail her daughter\'s murderer after Mexico\'s justice system failed to do so.','https://image.tmdb.org/t/p/w500/4E7nNHIchHWzpETfwAERxFuviO6.jpg','2020-10-14',8.9,0),(23410,'The Day of the Jackal','en','An international assassin known as ‘The Jackal’ is employed by disgruntled French generals to kill President Charles de Gaulle, with a dedicated gendarme on the assassin’s trail.','https://image.tmdb.org/t/p/w500/vThgcb3JOj99yETg8WChuci4LV2.jpg','1973-05-15',7.5,0),(23411,'Fist Fight','en','When one school teacher gets the other fired, he is challenged to an after-school fight.','https://image.tmdb.org/t/p/w500/huRhv4IZDk2ds0DIDkI6uxdmb6J.jpg','2017-02-16',6.1,0),(23412,'Lakeview Terrace','en','A young interracial couple has just moved into their California dream home when they become the target of their next-door neighbor, who disapproves of their relationship. A tightly wound LAPD officer has appointed himself the watchdog of the neighborhood. His nightly foot patrols and overly watchful eyes bring comfort to some, but he becomes increasingly aggressive to the newlyweds. These persistent intrusions into their lives cause the couple to fight back.','https://image.tmdb.org/t/p/w500/2ThsS74hopBz0RveLgOWiwrMfE8.jpg','2008-09-19',5.9,0),(23413,'Invincible','en','Inspired by the true story of Vince Papale, a man with nothing to lose who ignored the staggering odds and made his dream come true. When the coach of Papale\'s beloved hometown football team hosted an unprecedented open tryout, the public consensus was that it was a waste of time – no one good enough to play professional football was going to be found this way.','https://image.tmdb.org/t/p/w500/9Lu1uEF00xc2h7Db0BwL7zE25JA.jpg','2006-08-25',6.9,0),(23414,'Hard Boiled','cn','A cop who loses his partner in a shoot-out with gun smugglers goes on a mission to catch them. In order to get closer to the leaders of the ring he joins forces with an undercover cop who\'s working as a gangster hitman. They use all means of excessive force to find them.','https://image.tmdb.org/t/p/w500/wuljacjo7DCzUzDianeZZwPb6to.jpg','1992-04-16',7.6,0),(23415,'Cold Blood','en','A legendary but retired hit man lives in peace and isolation in the barren North American wilderness. When he rescues a woman from a snowmobiling accident, he soon discovers that she\'s harboring a secret that forces him to return to his lethal ways.','https://image.tmdb.org/t/p/w500/uGMIxhhMvQEE0mNlATXpEAG4mgl.jpg','2019-05-15',5.4,0),(23416,'Hereafter','en','Three people — a blue-collar American, a French journalist and a London school boy — are touched by death in different ways.','https://image.tmdb.org/t/p/w500/nOy0X8XSmSDOuwV8pqT70WoWHwT.jpg','2010-10-22',6,0),(23417,'Lord of the Flies','en','When their plane crashes, 25 schoolboys find themselves trapped on a tropical island, miles from civilization.','https://image.tmdb.org/t/p/w500/xhxWsFgBYyDfRWfOhM1OrV88QDJ.jpg','1990-03-16',6.3,0),(23418,'Little Miss Sunshine','en','A family loaded with quirky, colorful characters piles into an old van and road trips to California for little Olive to compete in a beauty pageant.','https://image.tmdb.org/t/p/w500/tFnTds88mCuLcLPBseK1kF2E3qv.jpg','2006-07-26',7.7,0),(23419,'Tell Me About Yourself','es','Chava, a 17-year-old boy who has a secret admirer, feels more attracted to boys. When leaving his school in a rainy day, Carlos offers him a ride, and so their adventure begins.','https://image.tmdb.org/t/p/w500/1BNLHd8oKsy76FzvR9s3E5v8KO9.jpg','2022-10-06',7.5,0),(23420,'The Walking Deceased','en','A group of survivors from all walks of the apocalypse – an idiotic Sheriff with definite coma-induced brain damage, his hardass son and a hobo with only a crossbow to stave off the walking dead, four squabbling friends forced to survive this zombieland together, and a lonely zombie who just needs love to fully regain his warm body – leave their once-safe mall hideout in search of the rumored Safe Haven Ranch, a refuge untouched by the zombie virus that has ravaged humanity.','https://image.tmdb.org/t/p/w500/i7X1Z7Oo4pJghgDmDoL1rIhyGJd.jpg','2015-03-20',5.3,0),(23421,'My Mother\'s Friend','it','A woman, who has just separated from her husband, comes to stay at the villa of the friend. The friend is away (and throughout the whole movie only appears as a voice on the phone), but the woman\'s goofy son (who looks like he just escaped from the Monkees) is staying there too. The son falls for her, not surprisingly since she always dresses in skimpy miniskirts or bikinis, and rarely closes the door when she is changing clothes or showering.','https://image.tmdb.org/t/p/w500/xmxpx76fbPzCAUs49mNzzgRnD6n.jpg','1975-03-05',4.7,0),(23422,'Sharknado 5: Global Swarming','en','Fin and his wife April travel around the world to save their young son who\'s trapped inside a sharknado.','https://image.tmdb.org/t/p/w500/cFC2OVsuPLoQ3D9l3i9sell9Bkz.jpg','2017-08-06',4.9,0),(23423,'A Ghost Story','en','Recently deceased, a white-sheeted ghost returns to his suburban home to console his bereft wife, only to find that in his spectral state he has become unstuck in time, forced to watch passively as the life he knew and the woman he loves slowly slip away.','https://image.tmdb.org/t/p/w500/rp5JPIyZi9sMob15l46zNQLe5cO.jpg','2017-04-24',7.1,0),(23424,'Unforgetful Holiday','cn','A sleazy PR Man (Cho) shows dumb mainland businessman (Ong) a fun time in HK. Cho finds him three lovely hostesses (Rena, Wing Chi and Git) and they go on an island tour, where they are stranded. But they have…','https://image.tmdb.org/t/p/w500/u8sxF6fPP6w1TfaZ6IVQyP2cOX4.jpg','1992-10-01',5.5,0),(23425,'The Ewok Adventure','en','The Towani family civilian shuttlecraft crashes on the forest moon of Endor. The four Towani\'s are separated. Jermitt and Catarine, the mother and father are captured by the giant Gorax, and Mace and Cindel, the son and daughter, are missing when they are captured. The next day, the Ewok Deej is looking for his two sons when they find Cindel all alone in the shuttle (Mace and Cindel were looking for the transmitter to send a distress call), when Mace appears with his emergency blaster. Eventually, the four-year old Cindel is able to convince the teenage Mace that the Ewoks are nice. Then, the Ewoks and the Towani\'s go on an adventure to find the elder Towanis.','https://image.tmdb.org/t/p/w500/lP7FIxojVrgWsam9efElk5ba3I5.jpg','1984-11-25',6,0),(23426,'Rust Creek','en','When an overachieving college senior makes a wrong turn, her road trip becomes a life-changing fight for survival in rural Kentucky.','https://image.tmdb.org/t/p/w500/lrsPIRkKZWTKbd3C0sSj7a3lMES.jpg','2019-01-04',6.4,0),(23427,'Wayne\'s World','en','The adventures of two amiably aimless metal-head friends, Wayne and Garth. From Wayne\'s basement, the pair broadcast a talk-show called \"Wayne\'s World\" on local public access television. The show comes to the attention of a sleazy network executive who wants to produce a big-budget version of \"Wayne\'s World\"—and he 