th grade year — before she begins high school.','https://image.tmdb.org/t/p/w500/xTa9cLhGHfQ7084UvoPQ2bBXKqd.jpg','2018-01-19',7.2,0),(23444,'Flight of the Navigator','en','12-year-old David is accidentally knocked out in the forest near his home, but when he awakens eight years have passed. His family is overjoyed to have him back, but is just as perplexed as he is that he hasn\'t aged. When a NASA scientist discovers a UFO nearby, David gets the chance to unravel the mystery and recover the life he lost.','https://image.tmdb.org/t/p/w500/tdRgQWMximj0tL6OWu9kRTtePmI.jpg','1986-07-30',6.9,0),(23445,'The Boy Who Killed My Parents','pt','Based on one of the most shocking and gruesome murder cases in Brazil, the film presents de Suzane von Richthofen\'s point of view of the events that led to the death of her parents.','https://image.tmdb.org/t/p/w500/h9onDM7U8KCv2nXQNCCayuGzt4z.jpg','2021-09-24',6.3,0),(23446,'The Idiots','da','With his first Dogma-95 film director Lars von Trier opens up a completely new film platform. With a mix of home-video and documentary styles the film tells the story of a group of young people who have decided to get to know their “inner-idiots” and thus not only facing and breaking their outer appearance but also their inner.','https://image.tmdb.org/t/p/w500/sm5Ljs2pHO3a5ZI5pgFBCS167bi.jpg','1998-04-28',6.5,0),(23447,'Parallel','en','A group of friends stumble upon a mirror that serves as a portal to a \"multiverse\", but soon discover that importing knowledge from the other side in order to better their lives brings increasingly dangerous consequences.','https://image.tmdb.org/t/p/w500/eUi9srjugUumdUK8sGO9ndMFXgI.jpg','2018-04-10',6.1,0),(23448,'Solomon Kane','en','A nomadic 16th century warrior, condemned to hell for his brutal past, seeks redemption by renouncing violence, but finds some things are worth burning for as he fights to free a young Puritan woman from the grip of evil.','https://image.tmdb.org/t/p/w500/jwwVNuGRUBXcudG6wOKP9U60BzU.jpg','2009-09-16',5.9,0),(23449,'The Hunted','en','In the wilderness of British Columbia, two hunters are tracked and viciously murdered by Aaron Hallum. A former Special Operations instructor is approached and asked to apprehend Hallum—his former student—who has \'gone rogue\' after suffering severe battle stress from his time in Kosovo.','https://image.tmdb.org/t/p/w500/iIl3l7BPenoVpdRJAqIXeIgMQvV.jpg','2003-03-11',6.2,0),(23450,'The Great Hack','en','Data—arguably the world’s most valuable asset—is being weaponized to wage cultural and political wars. The dark world of data exploitation is uncovered through the unpredictable, personal journeys of players on different sides of the explosive Cambridge Analytica/Facebook data story.','https://image.tmdb.org/t/p/w500/uIrGgUzasEUA7v8uChRhUUFzLwE.jpg','2019-01-26',6.9,0),(23451,'Mongol: The Rise of Genghis Khan','ru','The story recounts the early life of Genghis Khan, a slave who went on to conquer half the world in the 11th century.','https://image.tmdb.org/t/p/w500/wZ0yyU6BnRANXbYbDjrYI6XZFsz.jpg','2007-09-20',6.7,0),(23452,'A Grand Day Out','en','Wallace and Gromit have run out of cheese, and this provides an excellent excuse for the duo to take their holiday to the moon, where, as everyone knows, there is ample cheese.','https://image.tmdb.org/t/p/w500/og1s6iwv73WMShgNzg0WTtmrKXy.jpg','1990-05-18',7.5,0),(23453,'The Perfect Match','en','Terrence J. stars as Charlie, a playboy who\'s convinced that relationships are dead. His two best friends, Donald Faison and Robert C. Riley, bet him that if he sticks to one woman for one month, he\'s bound to get attached. Charlie denies this until he crosses paths with the beautiful and mysterious Eva, played by singer/actress Cassie. They may agree to a casual affair, but eventually Charlie is questioning whether he may actually want more.','https://image.tmdb.org/t/p/w500/sAiF9gKhb3gPbnp9g5nNhrfTqpL.jpg','2016-03-11',5.4,0),(23454,'Yummy','nl','A young couple travels to a 