acManus brothers Murphy and Connor must come out of hiding on a sheep farm in Ireland to fight for justice in Boston.','https://image.tmdb.org/t/p/w500/jFHtFInp3tYIBxkwWMfNJf1RBZW.jpg','2009-11-24',6,0),(23464,'Speed 2: Cruise Control','en','A disgruntled former employee hijacks the Seabourn Legend cruise liner. Set on a fixed course, without any means of communication and at the mercy of the hijacker, it\'s up to the one cop on vacation, and his soon to be fiancé (hopefully) Annie, to regain control of it before it kills the passengers and causes an environmental disaster. Insurmountable and daunting tasks awaits them on their  perilous journey throughout the ship trying to fend off the hijacker and save the passengers.','https://image.tmdb.org/t/p/w500/gnK1ocpwUTj24zAktzomOJsD2bu.jpg','1997-06-13',4.6,0),(23465,'House at the End of the Street','en','A mother and daughter move to a new town and find themselves living next door to a house where a young girl murdered her parents. When the daughter befriends the surviving son, she learns the story is far from over.','https://image.tmdb.org/t/p/w500/bgHeZ5g7YyxKcwWw1tgyAMy0czy.jpg','2012-09-21',5.8,0),(23466,'21 Grams','en','Paul Rivers, an ailing mathematician lovelessly married to an English émigré; Christina Peck, an upper-middle-class suburban housewife and mother of two girls; and Jack Jordan, a born-again ex-con, are brought together by a terrible accident that changes their lives.','https://image.tmdb.org/t/p/w500/hdS0to9nUpgK0Zm1bZAF6BWRae7.jpg','2003-09-06',7.3,0),(23467,'They Live Inside Us','en','Seeking inspiration for a new writing project, a man spends Halloween night in a notoriously haunted house. He soon realizes he is living in his own horror story.','https://image.tmdb.org/t/p/w500/hVGBsF3MvHuBxLsAaBVjNoU58X.jpg','2020-10-06',5.8,0),(23468,'The 33','en','Based on the true story of the collapse of a mine in San Jose, Chile—that left 33 miners isolated underground for 69 days.','https://image.tmdb.org/