ccounts, Tom and Violet are destined for their happily ever after. However, this engaged couple just keep getting tripped up on the long walk down the aisle.','https://image.tmdb.org/t/p/w500/drsY910CSoSkROYypNVwUxI875T.jpg','2012-04-27',5.8,0),(23475,'Pay It Forward','en','Like some other kids, 12-year-old Trevor McKinney believed in the goodness of human nature. Like many other kids, he was determined to change the world for the better. Unlike most other kids, he succeeded.','https://image.tmdb.org/t/p/w500/62OIokwaxFwBFWM147ijLJsaVJD.jpg','2000-10-20',7.3,0),(23476,'Hudson Hawk','en','Eddie Hawkins, called Hudson Hawk has just been released from ten years of prison and is planning to spend the rest of his life honestly. But then the crazy Mayflower couple blackmail him to steal some of the works of Leonardo da Vinci. If he refuses, they threaten to kill his friend Tommy.','https://image.tmdb.org/t/p/w500/g1FJLGg9TaCzgjCmTJmONGIhTar.jpg','1991-05-23',5.7,0),(23477,'Hannah Ha Ha','en','Hannah lives a content, hard-working life in the small town where she grew up. To her visiting older brother, she\'s just wasting her time. As their Summer together winds down, Hannah gets what wasting time really means.','https://image.tmdb.org/t/p/w500/bhnHk7UWQVs1Z7rzHXiytRYl5oU.jpg','2023-02-10',5,0),(23478,'Annie','en','An orphan in a facility run by the mean Miss Hannigan, Annie believes that her parents left her there by mistake. When a rich man named Oliver \"Daddy\" Warbucks decides to let an orphan live at his home to promote his image, Annie is selected. While Annie gets accustomed to living in Warbucks\' mansion, she still longs to meet her parents. So Warbucks announces a search for them and a reward, which brings out many frauds.','https://image.tmdb.org/t/p/w500/pPJ1HsJh1fjAUlvSJMLCYKriDnX.jpg','1982-05-21',6.5,0),(23479,'Don\'t Look Now... We\'re Being Shot At!','fr','During World War II, two French civilians and a downed British Bomber Crew set out from Paris to cross the demarcation line between Nazi-occupied Northern France and the South. From there they will be able to escape to England. First, they must avoid German troops - and the consequences of their own blunders.','https://image.tmdb.org/t/p/w500/91l4Sf3WJwrb0tSVPsOqnBXG8E6.jpg','1966-12-08',7.9,0),(23480,'La Vengeance sans visage','fr','','https://image.tmdb.org/t/p/w500/tjPaBQ3TMwsIUNaPqA6izfjg13.jpg','2023-02-06',9,0),(23481,'The Poison Rose','en','A down-on-his-luck PI is hired by his old flame to investigate a murder. But while the case at first appears routine, it slowly reveals itself to be a complex interwoven web of crimes, suspects and dead bodies.','https://image.tmdb.org/t/p/w500/gSzyUmg719TgAxarFZYWjLLMqvS.jpg','2019-05-23',4.6,0),(23482,'Brooklyn','en','In 1950s Ireland and New York, young Eilis Lacey has to choose between two men and two countries.','https://image.tmdb.org/t/p/w500/wSYxJKMSpHCLz2zqrRJb9RhxGz6.jpg','2015-10-20',7.3,0),(23483,'Rendez-vous avec le crime','fr','When Samson Brion, an undercover cop, arrives in his native village in the depths of Brittany, fifteen years after having abruptly left it, most of the inhabitants see this return in a very bad light. Notably Lila Sept-Vents, an impetuous native entrepreneur, who is trying to save her online dating agency from bankruptcy. When a series of suspicious deaths strikes this quiet village, and Lila discovers that all the victims were clients of her agency, having a cop under her roof could prove invaluable.','https://image.tmdb.org/t/p/w500/g7FqMbARpI1yjoM3qp3e4clVsVJ.jpg','2022-12-20',7.1,0),(23484,'My Little Pony: Equestria Girls','en','Via a magic mirror, Twilight Sparkle travels into an alternate universe in order to recover a crown that was stolen from the Crystal Empire. Upon her arrival she is horrified to learn that she has turned into a human.','https://image.tmdb.org/t/p/w500/zT92hPXA5X6ppKjnjf9VfU51aR8.jpg','2013-06-16',7.3,0),(23485,'#FBF','en','Teenage Annie inadvertently takes her mother\'s laptop instead of her own to visit her father in New Jersey. She quickly realizes that the laptop allows her to pretend to be her mother. She uses this to try to restore her parents\' marriage ....','https://image.tmdb.org/t/p/w500/7bNMPnGiX7t5bOiSjStriOLTxEJ.jpg','2022-03-31',5.5,0),(23486,'Mona Lisa Smile','en','The story of Katherine Ann Watson, a feminist teacher who studied at UCLA graduate school and in 1953 left her boyfriend behind in Los Angeles, California to teach at Wellesley College, a conservative women\'s private liberal arts college in Massachusetts, United States.','https://image.tmdb.org/t/p/w500/bg0VKsXnLjIZ0cHmZHZLs9gzrvm.jpg','2003-12-19',6.9,0),(23487,'Malcriados','es','This is a Colombian remake of the Mexican movie \"Nosotros los Nobles\". Three rich adult children are tricked by their father into believing that they are bankrupt and have to go into hiding in an attempt to get them to become more self-reliant.','https://image.tmdb.org/t/p/w500/98rGRMxelOtSGQXHdBDQBE2iCQD.jpg','2016-04-01',6.4,0),(23488,'Into the Blue 2: The Reef','en','When they\'re hired to recover the lost treasure of Columbus, married scuba divers Sebastian and Dani think they\'ve hit the jackpot. But as they get closer to the fortune, the couple begins to suspect their employers have their own agenda. Hitting upon the real plan, the two come to the chilling realization that they may be expendable and that there\'s much more than riches at stake.','https://image.tmdb.org/t/p/w500/jb0KPSNWMyDeSpZ6lRk030kV5W0.jpg','2009-04-21',5.3,0),(23489,'Bingo Hell','en','In the Barrio of Oak Springs live a strong and stubborn group of elderly friends who refuse to be gentrified. Their leader, Lupita, keeps them together as a community, a family. But little did they know, their beloved Bingo hall is about to be sold to a much more powerful force than money itself.','https://image.tmdb.org/t/p/w500/86VKuiaox9eVJTETel0ld7XZtiO.jpg','2021-10-01',4.9,0),(23490,'Fallen','en','For high schooler Aaron Corbett, turning 18 means becoming not just a man but a nephilim, too -- half human, half angel, with supernatural abilities.','https://image.tmdb.org/t/p/w500/bAyvqgi3RjQIPnt0CDInZ27opNK.jpg','2006-07-23',6.9,0),(23491,'Driven','en','FBI informant Jim Hoffman lures troubled automobile magnate John DeLorean to an undercover sting for cocaine trafficking.','https://image.tmdb.org/t/p/w500/5szS3NXiycrTL67AunS7TLG0EE0.jpg','2019-08-15',6.3,0),(23492,'Sexy Comedy','it','The children leave for the school trip and dad and mom board a nice girl who turns out to be the lover of their best friend. Which is then the husband of their best friend ...','https://image.tmdb.org/t/p/w500/9FYD6UmX4mPRXhg3BuFre0Ash3G.jpg','2001-01-26',5.2,0),(23493,'So Close','cn','A conflict of interest between two high-kicking assassin sisters is complicated as they\'re pursued by the criminals who hired them and an equally high-kicking female cop.','https://image.tmdb.org/t/p/w500/vSiQTLKilSEBoEyE9LdxWkURZqh.jpg','2002-05-14',6.8,0),(23494,'JJ+E','sv','Elisabeth and John-John live in the same city, but they inhabit different worlds.','https://image.tmdb.org/t/p/w500/g1OngP0vWRGrafk99vBgz6i4Xln.jpg','2021-09-08',5.4,0),(23495,'Avicii: True Stories','en','Documentary about the arena-packing Swedish DJ, chronicling his explosive rise to fame and surprising decision to retire from live performances in 2016.','https://image.tmdb.org/t/p/w500/52Q4HLe2U79O1QkskIy2JdEyeEv.jpg','2017-10-26',8,0),(23496,'The War Wagon','en','An ex-con seeks revenge on the man who put him in prison by planning a robbery of the latter\'s stagecoach, which is transporting gold. He enlists the help of a partner, who could be working for his nemesis.','https://image.tmdb.org/t/p/w500/wGSv9mfHocleVwH4Q8d38SkwQP.jpg','1967-05-26',6.9,0),(23497,'Kickboxer: Vengeance','en','Eric and Kurt Sloane are the descendants of a well-known Venice, California-based family of martial artists. Kurt has always been in older brother, Eric\'s shadow, as he lacks the instincts needed to become a champion. Against Kurt\'s concerns, Eric accepts a paid offer and travels to Thailand to challenge the Muay Thai champion Tong Po and fails with dire consequences. Kurt sets out for revenge. He trains with his brother\'s mentor, Master Durand, for a Muay Thai fight against the merciless champion, Tong Po. Durand first thinks Kurt is impossible to train, but through a series of spiritual exercises and tests, Durand discovers that Kurt has a deeper strength that will carry him through his final showdown with Tong Po.','https://image.tmdb.org/t/p/w500/9suFyXDE1MhZ8I8tuhmTd0fJ7G8.jpg','2016-07-14',5.1,0),(23498,'Dallas Buyers Club','en','Loosely based on the true-life tale of Ron Woodroof, a drug-taking, women-loving, homophobic man who in 1986 was diagnosed with HIV/AIDS and given thirty days to live.','https://image.tmdb.org/t/p/w500/7Fdh7gUq3plvQqxRbNYhWvDABXA.jpg','2013-11-01',7.9,0),(23499,'Quills','en','A nobleman with a literary flair, the Marquis de Sade lives in a madhouse where a beautiful laundry maid smuggles his erotic stories to a printer, defying orders from the asylum\'s resident priest. The titillating passages whip all of France into a sexual frenzy, until a fiercely conservative doctor tries to put an end to the fun.','https://image.tmdb.org/t/p/w500/aR0sUb5zOh7VgQ2fUn5Aeqv7VQE.jpg','2000-11-22',7.1,0),(23500,'They Call Me Trinity','it','The simple story has the pair coming to the rescue of peace-loving Mormons when land-hungry Major Harriman sends his bullies to harass them into giving up their fertile valley. Trinity and Bambino manage to save the Mormons and send the bad guys packing with slapstick humor instead of excessive violence, saving the day.','https://image.tmdb.org/t/p/w500/qY7iV4BJD5IXJU4iXlcZxKN8s9w.jpg','1970-12-22',7.6,0),(23501,'Dead for a Dollar','en','In 1897, veteran bounty hunter Max Borlund is deep into Mexico where he encounters professional gambler and outlaw Joe Cribbens — a sworn enemy he sent to prison years before. Max is on a mission to find and return Rachel Kidd, the wife of a wealthy businessman, who as the story is told to Max, has been abducted by Buffalo Soldier Elijah Jones. Max is ultimately faced with a showdown to save honor.','https://image.tmdb.org/t/p/w500/1AnXfjxFqMsQmUPSvt9YxUJhfFw.jpg','2022-09-30',5.5,0),(23502,'The Greatest Story Ever Told','en','From his birth in Bethlehem to his death and eventual resurrection, the life of Jesus Christ is given the all-star treatment in this epic retelling. Major aspects of Christ\'s life are touched upon, including the execution of all the newborn males in Egypt by King Herod; Christ\'s baptism by John the Baptist; and the betrayal by Judas after the Last Supper that eventually leads to Christ\'s crucifixion and miraculous return.','https://image.tmdb.org/t/p/w500/c21ON7BZn0jwdNl6ibZ1vhXJmpy.jpg','1965-02-15',6.4,0),(23503,'Seven Psychopaths','en','A struggling screenwriter inadvertently becomes entangled in the Los Angeles criminal underworld after his oddball friends kidnap a gangster\'s beloved Shih Tzu.','https://image.tmdb.org/t/p/w500/cfkdwxJd1gWGmT9kI0XXYfXNLmw.jpg','2012-10-12',6.8,0),(23504,'Grand Jeté','de','Dance teacher and mother Nadja left her son Mario with her own mother when he was little. Now she has reappeared on his doorstep, seeking a closeness that knows fewer and fewer boundaries. An uncompromising film about family relationships.','https://image.tmdb.org/t/p/w500/kW8Z3w5JJAR9jVyD5oue4aT8Ivg.jpg','2022-09-20',4.3,0),(23505,'Wish Upon a Unicorn','en','Two children discover that their mother is gone. The youngest of the pair, adventurer and upcomming singer, Long Johnson forces his older sister, Lily Johnson, to hunt down a unicorn with magical blood.','https://image.tmdb.org/t/p/w500/9juXj68arIv7A20X7FAiJlJGSJd.jpg','2020-09-15',7.1,0),(23506,'Joshua Tree','en','Wellman Santee (Dolph Lundgren) a former race car driver, whose livelihood is transporting exotic stolen super cars, is involved, with his partner Eddie, in shoot out, resulting in the deaths of his friend and a highway cop. Santee is framed for the cop\'s murder and jailed in a maximum security prison. A few months later, Santee breaks out after narrowly escaping an attempt on his life. He reaches a local diner where he steals a car, abducts the owner, Rita and flees, completely unaware that his hostage is a deputy sheriff. A massive manhunt ensues, spearheaded by Lt. Severance a tough, obessive cop. Santee leads the detective and his men on a dramatic high speed chase, from the desert wilderness to the streets of downtown Los Angeles. Santee\'s out to clear his name and when it comes to getting even, he\'s taking revenge into overdrive.','https://image.tmdb.org/t/p/w500/kKYMrf2iwyyBYbGYnzPVWV8LXUQ.jpg','1993-04-08',6,0),(23507,'The Dead Pool','en','Dirty Harry Callahan returns for his final film adventure. Together with his partner Al Quan, he must investigate the systematic murder of actors and musicians. By the time Harry learns that the murders are a part of a sick game to predict the deaths of celebrities before they happen, it may be too late...','https://image.tmdb.org/t/p/w500/mqwGpW0Ptrvz1GmfCnLAOA4cQ8g.jpg','1988-04-14',6.3,0),(23508,'Days of Being Wild','cn','Yuddy, a Hong Kong playboy known for breaking girls\' hearts, tries to find solace and the truth after discovering the woman who raised him isn\'t his mother.','https://image.tmdb.org/t/p/w500/acfLUO8E61u0ooWS6htbzTHDBcI.jpg','1990-12-15',7.3,0),(23509,'An Easy Girl','fr','Naïma has just turned 16. This summer, she will have to decide what she wants from life if she doesn’t want to miss out. Then her cousin Sofia arrives, with an amazing body and a dangerously seductive lifestyle. Naïma desires only to follow her own path, so long as it leads upwards… Despite the warnings of her best friend Dodo, she and Sofia will live through unforgettable encounters during a long summer 