ved from the man who once protected the world\'s freedom. Reluctantly called back into action by the government, Jack is tasked with turning a ragtag group of kids with special powers into a new generation of superheroes to save the world from certain destruction.','https://image.tmdb.org/t/p/w500/v4rSFmiy0v9D7qmKkaUVJn5UhZ1.jpg','2006-08-11',5.4,0),(23541,'Three Kings','en','A group of American soldiers stationed in Iraq at the end of the Gulf War find a map they believe will take them to a huge cache of stolen Kuwaiti gold hidden near their base, and they embark on a secret mission that\'s destined to change everything.','https://image.tmdb.org/t/p/w500/fClJQW8xn8wHOFqoA4jUn0PZh1f.jpg','1999-04-21',6.6,0),(23542,'Timecrimes','es','A man accidentally gets into a time machine and travels back in time nearly an hour. Finding himself will be the first of a series of disasters of unforeseeable consequences.','https://image.tmdb.org/t/p/w500/svQmmEyXbMMPKGvj2PYxi72tXwY.jpg','2007-10-05',7,0),(23543,'The Last Warrior: A Messenger of Darkness','ru','Now that Ivan is about to turn 21, he is now grown up and finally old enough to marry the beautiful Vasilisa. But when Vasilisa is kidnapped and trapped in modern Moscow, Ivan and his friends must travel to the present day to rescue her.','https://image.tmdb.org/t/p/w500/AwrDBmkHnz7mlUZ7tGzL3Ofkqo5.jpg','2021-12-23',6.9,0),(23544,'Dilwale','hi','Raj is a Mafia member. One day he meet a girl (Meera) while chasing by his rival gang and falls in love with her. Later he finds out that this girl is the daughter of the leader of his rival gang. Yet their love story continues until he was shot by his girlfriend upon a deep misunderstanding. After that incident these two lovers lives separate until their siblings fallen in love. With this new love story their paths intertwines again.','https://image.tmdb.org/t/p/w500/pYgPu6hhOr61knwbestTx4vSdMb.jpg','2015-12-18',6.6,0),(23545,'Halloween III: Season of the Witch','en','Dr. Daniel Chall