ne day, Anne has a stroke, and the couple\'s bond of love is severely tested.','https://image.tmdb.org/t/p/w500/yq8hSg68QcfqKim9iydrVe4ndX3.jpg','2012-09-20',7.8,0),(23556,'Jessabelle','en','A young woman recuperating at her father\'s run-down home after a tragic accident soon encounters a terrifying presence with a connection to her long-deceased mother.','https://image.tmdb.org/t/p/w500/oyszsO25OfSxkxhKCCnk9ZrAjkp.jpg','2014-11-07',5.4,0),(23557,'Empire of Dreams: The Story of the Star Wars Trilogy','en','From the earliest versions of the script to the blockbuster debuts, explore the creation of the Star Wars Trilogy.','https://image.tmdb.org/t/p/w500/vcCjlshWxybT9H6IlSKs3q0Qtkp.jpg','2004-09-12',7.8,0),(23558,'Persepolis','fr','In 1970s Iran, Marjane \'Marji\' Statrapi watches events through her young eyes and her idealistic family of a long dream being fulfilled of the hated Shah\'s defeat in the Iranian Revolution of 1979. However as Marji grows up, she witnesses first hand how the new Iran, now ruled by Islamic fundamentalists, has become a repressive tyranny on its own.','https://image.tmdb.org/t/p/w500/aU8i2QAdTyRR1nYb36Gq51xXP8p.jpg','2007-06-27',7.9,0),(23559,'Mr. Six','zh','Many years ago Mr. Six was a notorious gangster. That was back when there was still such a thing as honour among thieves, when criminals earned respect and maintained principles. These days Mr. Six is all but forgotten, a living relic residing in a narrow alley.  One day Six\'s son, Xiaobo, is abducted by some spoiled punks after he scratches their precious Ferrari. Mr. Six realizes that he must do whatever it takes to get his son back — even if that means returning to the life he thought he had left behind.','https://image.tmdb.org/t/p/w500/hVttIfMDjQwHdVpUYhxdBamkl02.jpg','2015-09-16',6.8,0),(23560,'The Swan Princess: A Royal Family Tale','en','Shortly after the Royal Family adopts a young girl named Alise, she is taken away into the forest. Princess Odette, Derek and their woodland 