.8,0),(23566,'Martians vs Mexicans','es','A group of martian aliens invade earth, but they never expected mexicans to be immune to their multiple attacks.','https://image.tmdb.org/t/p/w500/nJgST3eXOVB8w7aW6Cjnsc1BxEE.jpg','2018-03-09',7.9,0),(23567,'Cat\'s Eye','en','Three short stories by shock-meister Stephen King are linked by a stray cat that roams from one tale to the next in this creepy triptych that begins as Dick (James Woods) tries to quit smoking by any means necessary. Next, we meet Johnny, an adulterous man who\'s forced by his lover\'s husband onto a building\'s hazardous ledge. Finally, Amanda is threatened by an evil gnome who throws suspicion on the family cat.','https://image.tmdb.org/t/p/w500/kKyq7izpMkmr8sT2nLic5qAuJPo.jpg','1985-04-12',6.7,0),(23568,'iBoy','en','After an accident, Tom wakes from a coma to discover that fragments of his smart phone have been embedded in his head, and worse, that returning to normal teenage life is impossible because he has developed a strange set of super powers.','https://image.tmdb.org/t/p/w500/56Kxk34rOygEbxy6ZJPrRxi774z.jpg','2017-01-27',6,0),(23569,'Great Expectations','en','In this Dickens adaptation, orphan Pip discovers through lawyer Mr. Jaggers that a mysterious benefactor wishes to ensure that he becomes a gentleman. Reunited with his childhood patron, Miss Havisham, and his first love, the beautiful but emotionally cold Estella, he discovers that the elderly spinster has gone mad from having been left at the altar as a young woman, and has made her charge into a warped, unfeeling heartbreaker.','https://image.tmdb.org/t/p/w500/ynaFuVvW2jaG06pMV67dOhzMYfJ.jpg','1946-12-26',7.2,0),(23570,'Presumed Innocent','en','Rusty Sabich is a deputy prosecutor engaged in an obsessive affair with a coworker who is murdered. Soon after, he\'s accused of the crime. And his fight to clear his name becomes a whirlpool of lies and hidden passions.','https://image.tmdb.org/t/p/w500/jSPWptOsqU1nxXQe6muSPB0kD3c.jpg','1990-07-26',6.8,0),(23571,'Barbie Video Game Hero','en','Get ready to power up! When Barbie magically gets pulled into her favorite video game, she is excited to see she\'s transformed into a fun roller-skating character. In the game, she meets Cutie, the lovable cloud-shaped friend, and Bella, the roller-skating princess. Together, they soon discover a mischievous emoji is trying to take control of the game. As they travel from level to level, Barbie must rely on her amazing gaming skills and out-of-the box thinking to save her team and beat the game!','https://image.tmdb.org/t/p/w500/rWQPf9Q8CAHIpBP8SVLE3uaSmf4.jpg','2017-02-01',6.9,0),(23572,'King of New York','en','A former drug lord returns from prison determined to wipe out all his competition and distribute the profits of his operations to New York\'s poor and lower classes in this stylish and ultra violent modern twist on Robin Hood.','https://image.tmdb.org/t/p/w500/zV9EhZutS54AjRl8uEJZE14E712.jpg','1990-07-18',6.7,0),(23573,'Sky High','es','A commentary on Spanish society dressed as a thriller about the misadventures of a gang of young petty criminals after the real estate crash.','https://image.tmdb.org/t/p/w500/pUT5Fa1TskzkTmATpYGiW49PTEg.jpg','2020-12-18',6.1,0),(23574,'The Car: Road to Revenge','en','In a dilapidated cyberpunk city plagued by crime and corruption, an unscrupulous District Attorney is savagely murdered and tossed out of a building onto his brand new car. Mysteriously, the District Attorney and his car come back to life as a single being with a thirst for vengeance. The eerie driver-less car embarks on a vicious rampage exacting revenge on the criminals who murdered him. The Car: Road to Revenge is the stylized sequel to the unconventional horror cult classic The Car (1977), and features an homage to the original with the return of Ronny Cox as the Mechanic.','https://image.tmdb.org/t/p/w500/czynIdEiHjpGhUWMnoax7Q3lMAE.jpg','2019-01-08',6.5,0),(23575,'Aliens in the Attic','en','A group of kids 