ter.','https://image.tmdb.org/t/p/w500/hjePJQDv7GitTrEU67TANuhbytv.jpg','2018-04-04',6.3,0),(23592,'Animal World','zh','Drifting aimlessly through life, Kaisi has racked up debts of several million having borrowed money from his friends. Lured with the promise of writing it all off, Kaisi leaves his ailing mother and childhood sweetheart Qing to board the ship Destiny and attend a gambling party controlled by the mysterious Anderson. All players join the game with stars. For each game they lose, their opponent captures a star. Everyone is holding daggers behind their backs plotting dirty means by which to overcome their opponents. The game quickly deteriorates into a slaughter and Kaisi must battle save his own skin.','https://image.tmdb.org/t/p/w500/kxc25B05Gq4CbCoWbyTFf9iF0wn.jpg','2018-06-29',7.2,0),(23593,'Capernaum','ar','Zain, a 12-year-old boy scrambling to survive on the streets of Beirut, sues his parents for having brought him into such an unjust world, where being a refugee with no documents means that your rights can easily be denied.','https://image.tmdb.org/t/p/w500/cqkqrIDzvkFRWVbRRQLqtkXQoPu.jpg','2018-09-20',8.2,0),(23594,'Flawless','en','A female executive and a night janitor conspire to commit a daring diamond heist from their mutual employer, The London Diamond Corporation.','https://image.tmdb.org/t/p/w500/qENzVKfdyNBAwShcS0YhWeJe34M.jpg','2007-09-01',6.6,0),(23595,'General Cemetery','es','Set in Iquitos, the story follows Andrea (Airam Galliani), a 15-years-ago teenage girl, who suffers the death of his father. With the help of his friends from school, encourage her to contact him using the ouija. However, this triggers a series of terrifying events.','https://image.tmdb.org/t/p/w500/ahYTelGWA8zIgJFnUaNBQSDkHaK.jpg','2013-07-25',6.6,0),(23596,'The Corruption','it','The film takes place in Vicenza in 1956. Anna, a beautiful lawyer\'s wife, feels abandoned by her husband and grows closer to their maid, Angela. The maid convinces Anna to try increasingly daring erotic games.','https://image.tmdb.org/t/p/w500/nulJnrNAzJ2SIeeLOnTz0k0N1Wd.jpg','1986-04-17',5,0),(23597,'The Young Master','cn','Youthful martial arts master Lung is searching for his missing brother, when he is mistaken for a criminal on the run.  He must prove his innocence by solving the case himself, while local lawmen and merciless mercenaries are hot on his trail.','https://image.tmdb.org/t/p/w500/3qTQFQIoNHkCbVzBZPVKd5Jo13s.jpg','1980-02-09',6.9,0),(23598,'My Best Friend Anne Frank','nl','Based on the real-life friendship between Anne Frank and Hannah Goslar, from Nazi-occupied Amsterdam to their harrowing reunion in a concentration camp.','https://image.tmdb.org/t/p/w500/6codIHEKVYwbQ9Ey6CNoqWA9yxD.jpg','2021-10-07',6.8,0),(23599,'Black Mass','en','The true story of Whitey Bulger, the brother of a state senator and the most infamous violent criminal in the history of South Boston, who became an FBI informant to take down a Mafia family invading his turf.','https://image.tmdb.org/t/p/w500/zfwciv4LIJkNQsfuhYGv0Nkiweg.jpg','2015-09-04',6.5,0),(23600,'The Experiment','de','Das Experiment is a shocking psycho thriller about the potential for brutality that humans hide. Even more shocking is the fact that it’s based on an actual occurrence — a 1971 psychological experiment at Stanford University that was aborted prematurely when the experimenters lost control.','https://image.tmdb.org/t/p/w500/o6Yq5XcFfsmG5IVEy4qdJ8levmj.jpg','2001-03-07',7.4,0),(23601,'Hellraiser: Revelations','en','Two friends in Mexico discover the Lament Configuration and unleash Pinhead, but one decides to try to survive by swapping himself with someone else. Once they go missing, family members go in search of them, but find Pinhead instead.','https://image.tmdb.org/t/p/w500/m1uUFFpoEagIsyR7kUhxM5zrjqC.jpg','2011-10-18',3.7,0),(23602,'Bad Education','en','A superintendent of a school district works for the betterment of the student’s education when an embezzlement scheme is 