ins his film, he places his camera at the base of a British Columbia cliff and waits patiently for the star climber to come down to answer his questions. Marc André, a little uncomfortable, prefers to return to the depths of the forest where he lives in a tent with his girlfriend Brette Harrington. In the heart of winter, Peter films vertiginous solos on fragile ice. He tries to make appointments with the climber who is never there and does not seem really concerned by this camera pointed at him \"For me, it would not be a solo if there was someone else\" . Marc-André is thus, the \"pure light\" of the mountaineers of his time, which marvel Barry Blanchard, Alex Honnold or Reinhold Messner, interviewed in the film. An event film for an extraordinary character.','https://image.tmdb.org/t/p/w500/tYbSGAVbyACEExptLu63CxCGm4O.jpg','2021-09-07',7.6,0),(23608,'Wolf','en','Aging publisher Will Randall is at the end of his rope when a younger co-worker snatches his job out from under his nose. But after being bitten by a wolf, Will suddenly finds himself full of youthful vigor. As he struggles to regain his position, he becomes enthralled with Laura Alden, his former boss\'s daughter. And, as increasingly animal-like urges begin to overwhelm him, Randall worries that he may be turning into the creature that bit him.','https://image.tmdb.org/t/p/w500/8ocZb9x6rN82i8ZzZ05j1vWKVOC.jpg','1994-06-17',6.1,0),(23609,'Yes, God, Yes','en','Fifteen-year-old Alice has always been a good Catholic, but when an innocent AOL chat turns unexpectedly racy, she finds herself suddenly obsessed with sex.','https://image.tmdb.org/t/p/w500/ftR7yM9zfPooU9qnlxvhivesvP6.jpg','2017-04-23',6.3,0),(23610,'Halloweentown High','en','Marnie Piper prepares to begin a new school year, she asks the Halloweentown Hot Witches\' Council to work toward openness between Halloweentown and the mortal world. She proposes to bring a group of Halloweentown students to her own high school in the mortal world.','https://