500/AuFvrbtWSPiBPIv9ewH2DV4nhCD.jpg','1967-12-21',7.7,0),(23627,'Agora','en','A historical drama set in Roman Egypt, concerning philosopher Hypatia of Alexandria and her relationship with her slave Davus, who is torn between his love for her and the possibility of gaining his freedom by joining the rising tide of Christianity.','https://image.tmdb.org/t/p/w500/vecqZ79S2khD43b0gInfIquuzY3.jpg','2009-05-17',7,0),(23628,'Aliens vs Avatars','en','Six college friends blowing off steam on a camping trip, find themselves caught up in a cat and mouse hunt with an Alien monster. Not knowing what to do or who to trust, they struggle to protect themselves. Reluctantly, they join forces with another, seemingly friendly, alien, Ava, who orbits the Earth and appears to them in the form of an avatar. Having only one chance at stopping the monster, they must race to locate and repair the Ava’s earth sent robot, before it slaughters them one by one.','https://image.tmdb.org/t/p/w500/qjmeBXcIIoDoVJgaSpMTf9NtaSA.jpg','2011-09-20',2.8,0),(23629,'Sholay','hi','After his family is murdered by a notorious and ruthless bandit, a former police officer enlists the services of two outlaws to capture the bandit.','https://image.tmdb.org/t/p/w500/ya9bwgqA4eNl5bQ9QqS0jcmRoBS.jpg','1975-08-15',7.1,0),(23630,'Boo 2! A Madea Halloween','en','Madea and the gang encounter monsters, goblins and boogeymen at a haunted campground.','https://image.tmdb.org/t/p/w500/5nvP4etJ8ecQv8qZM08dK4BAzdK.jpg','2017-10-20',5.7,0),(23631,'Mitthye Premer Gaan','bn','A reclusive, introverted singer-songwriter embarks on a journey of self discovery after he falls in love with an ambitious, pragmatic girl. They are forced to navigate their insecurities, fears, dreams and reality while battling their own loneliness and existential crisis.','https://image.tmdb.org/t/p/w500/c8R6MFtKQpIvLxb7ZfMjJdCnZDn.jpg','2023-02-10',0,0),(23632,'Coming Home in the Dark','en','A school teacher is forced to confront a brutal act from his past when a pair of ruthless drifters takes him and his family on a nightmare road-trip.','https://image.tmdb.org/t/p/w500/ubDpUo7z5Kz8HMz2qv2bS66Y9uo.jpg','2021-08-12',5.7,0),(23633,'Shiloh','en','An abused beagle runs away from his owner. On the road, he meets young Marty Preston and follows him home. The boy immediately forms a bond with the dog and names him Shiloh. His stern father won\'t let him keep the dog because it belongs to Judd Travers, a local hunter. After Shiloh is mistreated again, he runs away and returns to Marty. Knowing his father will once again make him bring Shiloh back to Judd, he makes a home for the dog in an old shed up the hill from the Prestons\' house and hides him from his family. His secret is soon discovered when a stray attacks the dog one night and he must turn to his father for help.','https://image.tmdb.org/t/p/w500/rcgucx2QaFnqlIVLTQUSfi0js4r.jpg','1996-11-30',5.6,0),(23634,'The Invisible Boy: Second Generation','it','Three years later Michele (The Invisible boy) meets his mother and his twin sister. Both have stories and superpowers but their intentions may not be what Michele thinks.','https://image.tmdb.org/t/p/w500/oi6CgVTaDQAuCRbQqXjevlpa8kk.jpg','2018-01-04',6.4,0),(23635,'Unlocked','en','After failing to apprehend the terrorist behind a Paris attack that claimed dozens of lives, CIA agent Alice Racine is forced to live in London as a caseworker. Her mentor unexpectedly calls her back into action when the CIA discovers that another attack is imminent. Alice soon learns that the classified information she\'s uncovered has been compromised...','https://image.tmdb.org/t/p/w500/fBDLdEraxCBKGmOPb6pJPYiDQh1.jpg','2017-04-27',6.2,0),(23636,'Seduction','it','After returning to Catania after a long period of time, Giuseppe reunites with his old lover, Caterina. Her 15 year-old daughter, Graziella begins to seduce her mother\'s lover and he soon breaks down and begins an affair with her. As time passes Caterina begins having sneaking suspicions about Giuseppe\'s & Graziella\'s relationship.','https://image.tmdb.org/t/p/w500/phueHtZKCwAfc3Yb8wXQVf3nNSZ.jpg','1973-01-01',6.3,0),(23637,'Flowers in the Attic','en','After the death of her husband, a mother takes her kids off to live with their grandparents in a huge, decrepit old mansion. However, the kids are kept hidden in a room just below the attic, visited only by their mother who becomes less and less concerned about them and their failing health, and more concerned about herself and the inheritence she plans to win back from her dying father.','https://image.tmdb.org/t/p/w500/upcJxm5AquYh9lTPaJEQ6tgoVbg.jpg','1987-11-20',6.3,0),(23638,'Bad Girls','en','Four former harlots try to leave the wild west (Colorado, to be exact) and head north to make a better life for themselves. Unfortunately someone from Cody\'s past won\'t let it happen that easily.','https://image.tmdb.org/t/p/w500/cXY79luLXt2dzUP2Tx601zpZFzK.jpg','1994-04-22',5.4,0),(23639,'Tristan & Isolde','en','An affair between the second in line to Britain\'s throne and the princess of the feuding Irish spells doom for the young lovers.','https://image.tmdb.org/t/p/w500/AlrH53hsH0hsQ5GNp1Ip0GZetth.jpg','2006-04-07',6.7,0),(23640,'Popstar: Never Stop Never Stopping','en','When his new album fails to sell records, pop/rap superstar Conner4real goes into a major tailspin and watches his celebrity high life begin to collapse. He\'ll try anything to bounce back, anything except reuniting with his old rap group The Style Boyz.','https://image.tmdb.org/t/p/w500/mHevPHxVfyveuTWaamIvk5rIfKv.jpg','2016-06-03',6.6,0),(23641,'Dear Evan Hansen','en','Evan Hansen, a high schooler with social anxiety, unintentionally gets caught up in a lie after the family of a classmate who committed suicide mistakes one of Hansen’s letters for their son’s suicide note.','https://image.tmdb.org/t/p/w500/hKjBQhsnCMt86kPKpPwV4meeFPo.jpg','2021-09-24',6.4,0),(23642,'Mean Streets','en','A small-time hood must choose from 