val.','https://image.tmdb.org/t/p/w500/hPoSSqDqkKSIP2l3t6pyre9u5Ze.jpg','2016-11-11',5.8,0),(23649,'Crush','en','A secret admirer\'s crush on a high school athlete takes a fatal turn.','https://image.tmdb.org/t/p/w500/zhkznv0Xt6g3dXYWMB8VT0GYOSb.jpg','2013-03-13',6,0),(23650,'Section 8','en','After avenging the murder of his family, a former soldier is sprung from prison and recruited by a shadowy government agency.','https://image.tmdb.org/t/p/w500/3G1wHQNITyfiABp2fgytpiFMHf9.jpg','2022-09-23',7,0),(23651,'Ilsa: She Wolf of the SS','en','Ilsa is a warden at a Nazi death camp that conducts experiments on prisoners. Ilsa\'s goal is to prove that woman can withstand more pain and suffering than men and should be allowed to fight on the front lines.','https://image.tmdb.org/t/p/w500/kSB8msWxpqE4YENeKZJqd4CMdWd.jpg','1975-10-01',6.2,0),(23652,'Wild Things 2','en','Two Florida high school vixens hatch a murderous plan to win an inheritance, but they hadn\'t bargained for an escalating whirlpool of blackmail and sexual games with a sleazy insurance investigator who has his own plans for the money.','https://image.tmdb.org/t/p/w500/3aoRiK4Q36kS4kYWWeF1CG4HhZr.jpg','2004-02-19',5.2,0),(23653,'Gangster Squad','en','Los Angeles, 1949. Ruthless, Brooklyn-born mob king Mickey Cohen runs the show in this town, reaping the ill-gotten gains from the drugs, the guns, the prostitutes and — if he has his way — every wire bet placed west of Chicago. And he does it all with the protection of not only his own paid goons, but also the police and the politicians who are under his control. It’s enough to intimidate even the bravest, street-hardened cop… except, perhaps, for the small, secret crew of LAPD outsiders led by Sgt. John O’Mara and Jerry Wooters who come together to try to tear Cohen’s world apart.','https://image.tmdb.org/t/p/w500/1eW9kFSuTQfyMvZKtxlnwKRBvI.jpg','2013-01-10',6.3,0),(23654,'Police Story: Lockdown','zh','A man looking for the release of a long-time prisoner takes 