ul flight from the police a self-assured detective makes it his primary goal to catch the Driver. He promises pardons to a gang if they help to convict him in a set-up robbery. The Driver seeks help from The Player to mislead the detective.','https://image.tmdb.org/t/p/w500/eaPcjoGR3ZzHTNTeHGqmihOyLN7.jpg','1978-06-08',7.2,0),(23660,'Jessica Darling\'s It List','en','Jessica Darling – a smart, witty, opinionated girl heading into 7th grade – was never too concerned about where she\'d fit in the middle school hierarchy. But before her first day of school, her older sister — the super popular Bethany, now in college—decides to help out by giving her the “It List”—a cheat sheet on how to navigate the middle school maze and rise to the top of the popularity chain. The instructions appear simple enough to follow, but, like life, nothing is as easy as it seems.','https://image.tmdb.org/t/p/w500/jBKr84871j6gA7Hylliu9nntMO7.jpg','2016-06-21',5.9,0),(23661,'Bone Tomahawk','en','During a shootout in a saloon, Sheriff Hunt injures a suspicious stranger. The doctor\'s assistant, wife of the local foreman, tends to him in prison. That night, the town is attacked and they both disappear—only the arrow of a cannibal tribe is found. Hunt and a few of his men go in search of the prisoner and the foreman\'s wife.','https://image.tmdb.org/t/p/w500/4MmTHpn2Y8emqvBgvOjufImUmKZ.jpg','2015-10-23',6.8,0),(23662,'Wuthering Heights','en','Young orphan Heathcliff is adopted by the wealthy Earnshaw family and moves into their estate, Wuthering Heights. Soon, the new resident falls for his compassionate foster sister, Cathy. The two share a remarkable bond that seems unbreakable until Cathy, feeling the pressure of social convention, suppresses her feelings and marries Edgar Linton, a man of means who befits her stature. Heathcliff vows to win her back.','https://image.tmdb.org/t/p/w500/fYjS2FFChGZGhJI15sY78m0V9mu.jpg','1992-10-16',6.7,0),(23663,'Honey 3: Dare to Dance','en','While attending college in Cape Town, Melea Martin feels constrained by the school\'s strict policies, and decides to set out on her own. Searching for a way to use her talents as a dancer and inspire the community around her, Melea rents a failing theater in order to put on a Hip-Hop Romeo and Juliet performance. But much like the Capulets and Montagues, conflicts between cast members threaten to bring the whole performance to a halt...','https://image.tmdb.org/t/p/w500/2qsCUy88FPiHxOSFXdkKlmJz7Hw.jpg','2016-11-30',6.6,0),(23664,'Against All Odds','en','She was a beautiful fugitive. Fleeing from corruption. From power. He was a professional athlete past his prime. Hired to find her, he grew to love her. Love turned to obsession. Obsession turned to murder. And now the price of freedom might be nothing less than their lives.','https://image.tmdb.org/t/p/w500/Ac0m41QYoxYBfRoU4cL491vOfEv.jpg','1984-03-02',5.6,0),(23665,'Only Lovers Left Alive','en','A depressed musician reunites with his lover in the desolate streets of Detroit. Though their romance has endured several centuries, it is tested by the arrival of her capricious and unpredictable younger sister.','https://image.tmdb.org/t/p/w500/kffoWJ7FfPRlFFBGixOMbq3blQp.jpg','2013-12-12',7.3,0),(23666,'Taking Lives','en','Recruited to assist Montreal police in their desperate search for a serial killer who assumes the identities of his victims, FBI profiler Illeana Scott knows it\'s only a matter of time before the killer strikes again. Her most promising lead is a museum employee who might be the killer\'s only eyewitness.','https://image.tmdb.org/t/p/w500/zeFGOS1kj0CxuZjGhtK3WlMCYsa.jpg','2004-03-19',6.4,0),(23667,'Return of the Seven','en','Chico one of the remaining members of The Magnificent Seven now lives in the town that they (The Seven) helped. One day someone comes and takes most of the men prisoner. His wife seeks out Chris, the leader of The Seven for help. Chris also meets Vin another member of The Seven. They find four other men and they go to help Chico.','https://image.tmdb.org/t/p/w500/xO3cPFFzXa7zZ704dOwgws5duFK.jpg','1966-10-19',6.2,0),(23668,'The War of the Roses','en','The Roses, Barbara and Oliver, live happily as a married couple. Then she starts to wonder what life would be like without Oliver, and likes what she sees. Both want to stay in the house, and so they begin a campaign to force each other to leave. In the middle of the fighting is D\'Amato, the divorce lawyer. He gets to see how far both will go to get rid of the other, and boy do they go far.','https://image.tmdb.org/t/p/w500/9VWwYsuXhRImUtrJGvN6bYJB2He.jpg','1989-12-08',6.9,0),(23669,'The Interpreter','en','After Silvia Broome, an interpreter at United Nations headquarters, overhears plans of an assassination, an American Secret Service agent is sent to investigate.','https://image.tmdb.org/t/p/w500/wTidq3J9fh8sEOAlD8WZFHVLSuB.jpg','2005-04-08',6.3,0),(23670,'LOL','en','In a world connected by YouTube, iTunes, and Facebook, Lola and her friends navigate the peer pressures of high school romance and friendship while dodging their sometimes overbearing and confused parents. When Lola\'s mom, Anne, \"accidentally\" reads her teenage daughter\'s racy journal, she realizes just how wide their communication gap has grown.','https://image.tmdb.org/t/p/w500/AlnBUoKzzPnczrzzxuh0SYwDa3Z.jpg','2012-02-10',6.1,0),(23671,'Contract Killer','cn','Financially troubled, a newbie hitman reluctantly takes the job of finding the plotted killer of a Japanese tycoon.','https://image.tmdb.org/t/p/w500/oLOFr2PGrtNmQ9rLshIKr6T41UK.jpg','1998-04-03',7,0),(23672,'Exorcist: The Beginning','en','Having lived through traumatizing events during WWII, Father Lankester Merrin takes a sabbatical from the Church to conduct archaeological excavations in British-administered East Africa. Merrin unearths an ancient Byzantine church believed have been built and then immediately buried to keep down evil from the crypt below. The natives are convinced 