 money. Doc knows Jack Benyon, a rich \"business\"-man, is up to something big, so he tells his wife (Carol McCoy) to tell him that he\'s for sale if Benyon can get him out of prison. Benyon pulls some strings and Doc McCoy is released again. Unfortunately he has to cooperate with the same person that got him to prison.','https://image.tmdb.org/t/p/w500/4tWvZ4BQu3ICmtUL8lXHa9OgkoF.jpg','1994-02-11',5.6,0),(23678,'Girlfriends and Girlfriends','es','They are in their thirties but live just as they did in their twenties. They are in love with love but, in their search, they tear each other apart, wandering from ex-girlfriend to ex-girlfriend, from relationship to relationship.','https://image.tmdb.org/t/p/w500/eBeyVLW96Rktf46JUAYSutE3q6n.jpg','2023-02-03',6,0),(23679,'Big Fat Liar','en','After one of his class papers is stolen and turned into a movie, a young student and his best friend exact a hilarious, slapstick revenge on the Hollywood hot shot who has taken credit!','https://image.tmdb.org/t/p/w500/k1MkctTLNWthU2AUlX4qOCNBlPc.jpg','2002-02-08',5.9,0),(23680,'Nerisa','tl','Misfortune starts to happen on an island when a beautiful maiden is washed ashore. She falls in love with a local fisherman who eventually disappears after a sea accident. She commits to do and to give everything, even her body, in order to find him.','https://image.tmdb.org/t/p/w500/zY4AnEPcNPEA6oEE288qYfw6Kqq.jpg','2021-07-30',8.1,0),(23681,'Cage Dive','en','Three friends from California are filming an audition tape for an extreme reality game show. They document their journey to Australia where they will be doing their most dangerous activity.... Shark Cage Diving. A catastrophic turn of events leaves them in baited water full of Great White Sharks, turning their recording into a blood chilling diary of survival... and death.','https://image.tmdb.org/t/p/w500/3uUO9eDxHeDREIX77BaQiI88ajp.jpg','2017-08-11',4.6,0),(23682,'Under the Same Moon','es','Tells the parallel stories of nine-year-old Carlitos and his mother, Rosario. In the hopes of providing a better life for her son, Rosario works illegally in the U.S. while her mother cares for Carlitos back in Mexico.','https://image.tmdb.org/t/p/w500/u4etTLnOF5n4HZcFPxgyHMzizZz.jpg','2008-03-20',7.7,0),(23683,'Monster Hunter: Legends of the Guild','en','In a world where humans and fearsome monsters live in an uneasy balance, young hunter Aiden fights to save his village from destruction by a dragon.','https://image.tmdb.org/t/p/w500/fctSbleL7ozVcGyC163nPv4arW1.jpg','2021-08-12',5.6,0),(23684,'Hubie Halloween','en','Hubie Dubois, despite his devotion to his hometown of Salem, Massachusetts (and its legendary Halloween celebration), is a figure of mockery for kids and adults alike. But this year, something really is going bump in the night, and it’s up to Hubie to save Halloween.','https://image.tmdb.org/t/p/w500/dbhC6qRydXyRmpUdcl9bL9rARya.jpg','2020-10-07',6,0),(23685,'The Last Black Man in San Francisco','en','Jimmie Fails dreams of reclaiming the Victorian home his grandfather built in the heart of San Francisco. Joined on his quest by his best friend Mont, Jimmie searches for belonging in a rapidly changing city that seems to have left them behind.','https://image.tmdb.org/t/p/w500/ow9zjibNrz5TYVZ6cqwmvCR1YX1.jpg','2019-06-07',7.1,0),(23686,'Interstate 60','en','An aspiring painter meets various characters and learns valuable lessons while traveling across America.','https://image.tmdb.org/t/p/w500/zZQt29qBWLoVVOo8HEFzFYRAgYQ.jpg','2002-04-13',7.3,0),(23687,'Memories of a Teenager','es','After the suicide of his best friend and the fire of a local dance called Cromañón, including recitals, illegal parties in an abandoned warehouse and high school, a year passes by in the life of Zabo who writes everything he feels and lives in his blog, \"Memories of a teenager\".','https://image.tmdb.org/t/p/w500/tBuYNodLru48rGFbBUM8TGBIxb6.jpg','2019-11-18',7.8,0),(23688,'They Call Me Renegade','en','While on his travel across the Southwestern United States, with his Jeep CJ Renegade and his chestnut colt named Joe Brown, Luke meets Matt, son of a friend of his, Moose, who is in jail. Moose asks Luke to take care of Matt, and to help him to take possession of a piece of land. So starts their travel, full of adventures...','https://image.tmdb.org/t/p/w500/gMvLRSN7sLDIjoc0MkQZGjBo2gi.jpg','1987-10-30',6,0),(23689,'Dracula 2000','en','Abraham Van Helsing, who has tangled with Count Dracula in the past, works as an English antiques dealer. Simon is a vampire hunter in training under his apprenticeship.','https://image.tmdb.org/t/p/w500/uSOaVTCsMnqM0Nxr5GSTZhHMDbI.jpg','2000-12-22',5.2,0),(23690,'Drop Zone','en','A team of skydiving crooks led by rogue DEA agent Ty Moncrief specialize in landing on police roofs and breaking in so they can steal undercover agents\' files and sell them to drug lords. Federal Marshal Pete Nessip lost a brother to this crew and learns skydiving with the help of the tough instructor Jessie Crossmann so he can track them down.','https://image.tmdb.org/t/p/w500/bbveyfmq6pGrzKL0l4waeA2WHHp.jpg','1994-12-08',5.7,0),(23691,'The Secret','en','Interviews with leading authors, philosophers and scientists, with an in-depth discussion of the Law of Attraction. The audience is shown how they can learn and use \'The Secret\' in their everyday lives.','https://image.tmdb.org/t/p/w500/zLcm3V8tjybWZVbE0MIwJfvmv0g.jpg','2006-03-26',6.7,0),(23692,'Starstruck','en','Pop star Christopher Wilde has fame, fortune and a big-budget Hollywood movie awaiting him. But after meeting Jessica Olson, a down-to-earth girl from the Midwest, he is faced with following his heart or doing what\'s best for his career.','https://image.tmdb.org/t/p/w500/1CgkCNF5fYAp9d5pDzp7BEnZD0b.jpg','2010-02-14',7,0),(23693,'Cruel Intentions 3','en','Meet Cassie, Jason and Patrick, three amoral college students who, through a series of sexual wagers, take malicious pleasure in ruining the lives of their fellow 