estigates a reported haunting at a boys boarding school.','https://image.tmdb.org/t/p/w500/9SJHeGRlpwkJknUMo7DPg7frrnH.jpg','2011-08-17',6.4,0),(23706,'The Good Doctor','en','Dr. Martin Blake, who has spent his life looking for respect, meets an 18-year-old patient named Diane, suffering from a kidney infection, and gets a much-needed boost of self-esteem. However, when her health starts improving, Martin fears losing her, so he begins tampering with her treatment, keeping Diane sick and in the hospital right next to him.','https://image.tmdb.org/t/p/w500/fJSdqHzpMeCkXMrILYt1SdGN2sL.jpg','2011-04-23',6.2,0),(23707,'The Marine 4: Moving Target','en','WWE Superstar Mike \"The Miz\" Mizanin returns as Jake Carter where he is assigned to protect a whistleblower who wishes to expose a corrupt military defense contractor. However, the military hires a heavily armed team of mercenaries to kill her and it\'s up to Carter to stop them at any cost.','https://image.tmdb.org/t/p/w500/qpOV33E2JARGqWsdicAh7BZAmya.jpg','2015-04-10',6.4,0),(23708,'A Charlie Brown Christmas','en','When Charlie Brown complains about the overwhelming materialism that he sees amongst everyone during the Christmas season, Lucy suggests that he become director of the school Christmas pageant. Charlie Brown accepts, but is a frustrating struggle. When an attempt to restore the proper spirit with a forlorn little fir Christmas tree fails, he needs Linus\' help to learn the meaning of Christmas.','https://image.tmdb.org/t/p/w500/vtaufTzJBMJAeziQA1eP4BLU24C.jpg','1965-12-09',7.7,0),(23709,'Superman II: The Richard Donner Cut','en','Superman agrees to sacrifice his powers to start a relationship with Lois Lane, unaware that three Kryptonian criminals he inadvertently released are conquering Earth.','https://image.tmdb.org/t/p/w500/3YBiNR15YyEnqN6zlc6GUCEa1Ia.jpg','2006-11-02',7.5,0),(23710,'Inland Empire','en','An actress’s perception of reality becomes increasingly distorted as she finds herself falling for 