ccount-draining nightmare. Struggling to keep their relationship together as their rambling mansion falls to pieces around them, the two watch in hilarious horror as everything—including the kitchen sink—disappears into the Money Pit.','https://image.tmdb.org/t/p/w500/bohhidIi1WWU5NNYF9l5wLQu3Ii.jpg','1986-03-26',6.5,0),(23721,'Marvel Rising: Secret Warriors','en','When a threat no one could have expected bears down on the Marvel Universe, this ragtag, untrained band of teens have no choice but to rise together and prove to the world that sometimes the difference between a \'hero\' and \'misfit\' is just in the name.','https://image.tmdb.org/t/p/w500/kY1ufnbv2bTyoNcAtGF4BwapKi6.jpg','2018-09-30',6.9,0),(23722,'Body of Evidence','en','When an elderly millionaire is found dead with cocaine in his system, his will leaves $8 million to Rebecca Carlson, who was having an affair with him. District attorney Robert Garrett decides to prosecute Rebecca, arguing that she deliberately engaged in wild sex with the old man to overexcite him and lead to his premature death. Defense attorney Frank Dulaney defends Rebecca in court while getting sucked into a dangerous affair with her.','https://image.tmdb.org/t/p/w500/4bmaNBlZCe5pl2Xy8BDWBPeV8jd.jpg','1993-01-15',4.9,0),(23723,'Paycheck','en','Michael Jennings is a genius who\'s hired – and paid handsomely – by high-tech firms to work on highly sensitive projects, after which his short-term memory is erased so he\'s incapable of breaching security. But at the end of a three-year job, he\'s told he isn\'t getting a paycheck and instead receives a mysterious envelope. In it are clues he must piece together to find out why he wasn\'t paid – and why he\'s now in hot water.','https://image.tmdb.org/t/p/w500/icoa6KslkhXKnxLreZ6vXnDimpQ.jpg','2003-12-25',6.2,0),(23724,'Dr. Dolittle 2','en','A group of beavers ask Dr. Dolittle to save their habitat from loggers. The only hope is to get the forest preserved because it\'s the home of a protected bear, but there\'s a problem: the bear\'s the only bear in the forest, so she can\'t reproduce. Undaunted, Dolittle persuades a circus bear to help out, but he has to teach him not just the ways of the wild, but the wiles of lady bears too.','https://image.tmdb.org/t/p/w500/asYjHXBoD44B6mLOcZtMfMV3hm1.jpg','2001-06-22',5.3,0),(23725,'Fantastic Beasts: A Natural History','en','Stephen Fry embarks on a journey to discover the stories behind some of the world\'s most fantastic beasts that have inspired myths and legends in history, story-telling and film.','https://image.tmdb.org/t/p/w500/icqVeNNQPZ6vzQFirqcAHGchHCB.jpg','2022-02-27',7,0),(23726,'Mystery Men','en','When Champion City\'s hero Captain Amazing is kidnapped by the recently paroled supervillain Casanova Frankenstein, a trio of average, everyday superheroes -- Mr. Furious, the Shoveler and the Blue Raja -- assemble a new super team to save him.','https://image.tmdb.org/t/p/w500/3O2uzpG97ndCeAWgS22rNB2xL6N.jpg','1999-08-06',5.8,0),(23727,'Jim Jefferies: High n\' Dry','en','No topic is off limits for Jim Jefferies as he muses on stoned koalas, his dad’s vasectomy confusion and choosing between his hair and his sex drive.','https://image.tmdb.org/t/p/w500/noFxBWGrPtMgyNufgvdLF8P5um.jpg','2023-02-14',2.5,0),(23728,'211','en','Inspired by one of the longest and bloodiest real-life events in police history, Officer Mike Chandler and a young civilian passenger find themselves under-prepared and outgunned when fate puts them squarely in the crosshairs of a daring bank heist in progress by a fearless team of highly-trained and heavily-armed men.','https://image.tmdb.org/t/p/w500/81RColr4rau6DZ7z9eMsksokcfk.jpg','2018-05-30',5.4,0),(23729,'Honk for Jesus. Save Your Soul.','en','In the aftermath of a huge scandal, Trinitie Childs, the first lady of a prominent Southern Baptist Mega Church, attempts to help her pastor-husband, Lee-Curtis Childs, rebuild their congregation.','https://image.tmdb.org/t/p/w500/gC5HfzG2