hey\'re sent to prison.','https://image.tmdb.org/t/p/w500/ehCdQewg9SxjhnimJrKwNKbr80C.jpg','1980-12-12',6.5,0),(23743,'Happy Death Day to Us','en','','https://image.tmdb.org/t/p/w500/ue5wV2XLP6KRsFLX7ak14DyqT87.jpg','0000-00-00',0,0),(23744,'The Untold Story','cn','In 1978 in Hong Kong, a grisly murder takes place. Eight years later, on a Macao beach, kids discover the severed hands of a fresh victim. A squadron of coarse, happy-go-lucky cops investigate, and suspicion falls on Wong Chi Hang, the new owner of Eight Immortals Restaurant, which serves delicious pork bao. The hands belong to the missing mother of the restaurant\'s former owner; he and his family have disappeared; staff at the restaurant continue to go missing; and, Wong can\'t produce a signed bill of sale: but there\'s no evidence. The police arrest Wong and try to torture him into a confession. Can they make him talk? And what was in those pork bao?','https://image.tmdb.org/t/p/w500/tQ7Ymo92AOXZFrMX5TBAfAdYECt.jpg','1993-05-13',6.1,0),(23745,'The Bride of Frankenstein','en','After recovering from injuries sustained in the mob attack upon himself and his creation, Dr. Frankenstein falls under the control of his former mentor, Dr. Pretorius, who insists the now-chastened doctor resume his experiments in creating new life. Meanwhile, the Monster remains on the run from those who wish to destroy him without understanding that his intentions are generally good despite his lack of socialization and self-control.','https://image.tmdb.org/t/p/w500/5241zUwe7rC17MNc2QpCBKKdp1N.jpg','1935-04-20',7.6,0),(23746,'Bullet to the Head','en','After watching their respective partners die, a cop and a hitman form an alliance in order to bring down their common enemy.','https://image.tmdb.org/t/p/w500/arJfxShfuZPhqfBZZU6DkPZfnjn.jpg','2013-01-31',5.6,0),(23747,'Cro Minion','en','Two minions have to babysit a little Neanderthal baby.','https://image.tmdb.org/t/p/w500/gduXRlGrywqLry0sdDrf37Tyibh.jpg','2015-11-04',7.1,0),(2