he decline, looking for a place to call home. On that same day, a local prospector discovers gold - and is murdered.','https://image.tmdb.org/t/p/w500/58UKdNFfSSvx8TuecGAzqja3NTZ.jpg','2022-06-24',5.7,0),(23759,'Apollo 10½:  A Space Age Childhood','en','A man narrates stories of his life as a 10-year-old boy in 1969 Houston, weaving tales of nostalgia with a fantastical account of a journey to the moon.','https://image.tmdb.org/t/p/w500/43EQZnWP9znGqTKfO4BsPALXVYa.jpg','2022-03-24',7.1,0),(23760,'Derailed','en','When two married business executives having an affair are blackmailed by a violent criminal, they are forced to turn the tables on him to save their families.','https://image.tmdb.org/t/p/w500/bcCoOkwEBHUS5Y7Rm1u1oTLUHdb.jpg','2005-11-11',6.3,0),(23761,'Novitiate','en','In the early 1960s, during the Vatican II era, a young woman training to become a nun struggles with issues of faith, sexuality and the changing church.','https://image.tmdb.org/t/p/w500/eZ9BbRy4YGFM1yvx6ZDO7qzILJ.jpg','2017-10-27',6.4,0),(23762,'The Old Ways','en','Cristina, a journalist of Mexican origin, travels to her ancestral home in Veracruz to investigate a story of sorcery and healing. There, she is kidnapped by a group of locals who claim she\'s the devil incarnated.','https://image.tmdb.org/t/p/w500/jYnedFgdnN62QXE8HAPVtQKNFFm.jpg','2020-10-16',7,0),(23763,'The Secret of Moonacre','en','When 13 year old Maria Merryweather\'s father dies, leaving her orphaned and homeless, she is forced to leave her luxurious London life to go and live with Sir Benjamin, an eccentric uncle she didn\'t know she had, at the mysterious Moonacre Manor.','https://image.tmdb.org/t/p/w500/pda5hNeCxq5ls9mFfD4UtlEHeRY.jpg','2008-09-06',6.5,0),(23764,'Ironclad','en','In the year 1215, the rebel barons of England have forced their despised King John to put his royal seal on the Magna Carta, a seminal document that upheld the rights of free men. Yet within months of pledging himself to the great charter, the King reneged on his word and assembled a mercenary army on the south coast of England with the intention of bringing the barons and the country back under his tyrannical rule. Barring his way stood the mighty Rochester castle, a place that would become the symbol of the rebel\'s momentous struggle for justice and freedom.','https://image.tmdb.org/t/p/w500/7ACf5GwwzmzuTFzPLEg9ZagvXUa.jpg','2011-03-03',6.2,0),(23765,'¡Three Amigos!','en','A trio of unemployed silent film actors are mistaken for real heroes by a small Mexican village in search of someone to stop a malevolent bandit.','https://image.tmdb.org/t/p/w500/keQ4ra50w1nktSPRPauxpLaAM2F.jpg','1986-12-12',6.4,0),(23766,'Ben 10 Generator Rex Heroes United','en','Ben Tennyson falls through a wormhole and encounters Rex. The two heroes must unite against a foe that can absorb their powers.','https://image.tmdb.org/t/p/w500/iSPCeuGiN06540ZUCfcunc4hOm3.jpg','2011-11-25',6.9,0),(23767,'The Devil\'s Backbone','es','Spain, 1939. In the last days of the Spanish Civil War, the young Carlos arrives at the Santa Lucía orphanage, where he will make friends and enemies as he follows the quiet footsteps of a mysterious presence eager for revenge.','https://image.tmdb.org/t/p/w500/iP1z1aJzPnkP8FHg77TS7ukqoEZ.jpg','2001-04-20',7.3,0),(23768,'100 Things','de','Best friends Toni and Paul decide to relinquish all of their belongings for 100 days, whereby they receive one of their items back on each day. During this challenge the two realize, that the only thing they cannot be without is their friendship. A story about contemporary materialism and the quest for the truely important things in life.','https://image.tmdb.org/t/p/w500/yTfpEmMitPaOOmzRZ3NGvLhamz6.jpg','2018-12-06',6.7,0),(23769,'Sweeter Than Chocolate','en','A local bakery is rumored to have the secret recipe to finding true love on Feb. 14, drawing in a TV reporter to investigate.','https://image.tmdb.org/t/p/w500/lrzaNZgwftpiGO29LnUajnTyD1l.jpg','2023-02-04',5.5,0),(23770