he Witch','it','An old man dies and as his relatives await their dosh they start getting killed, sort of by a witch!','https://image.tmdb.org/t/p/w500/rmwtO9JVVRn2t5lg5FKFBC4IQDK.jpg','1973-01-01',5.1,0),(23787,'House Party','en','Young Kid has been invited to a party at his friend Play\'s house. But after a fight at school, Kid\'s father grounds him. None the less, Kid sneaks out when his father falls asleep. But Kid doesn\'t know that three of the thugs at school have decided to give him a lesson in behavior.','https://image.tmdb.org/t/p/w500/4vPYZzMy9YyqDryETRVeILJ4ELq.jpg','1990-03-09',6.4,0),(23788,'Survive the Night','en','A disgraced doctor and his family are held hostage at their home by criminals on the run, when a robbery-gone-awry requires them to seek immediate medical attention.','https://image.tmdb.org/t/p/w500/z3YyfWhzqvYqdd8YV6eixFEZJ3X.jpg','2020-07-09',5.1,0),(23789,'Vixen!','en','Vixen lives in a Canadian mountain resort with her naive pilot husband. While he\'s away flying in tourists, she gets it on with practically everybody including a husband and his wife, and even her biker brother. She is openly racist, and she makes it clear that she won\'t do the wild thing with her brother\'s biker friend, who is black.','https://image.tmdb.org/t/p/w500/9KMZWDA3xTrlgrScqdMisINQmsh.jpg','1968-10-15',5.3,0),(23790,'LSD (Laal Suitcase Ta Dekhechen?)','bn','','https://image.tmdb.org/t/p/w500/cN1KyWUHzAURlQgrUEUIL79PxEW.jpg','2023-02-10',0,0),(23791,'American Satan','en','A young rock band, half from England and half from the US, drop out of college and move to the Sunset Strip to chase their dreams.','https://image.tmdb.org/t/p/w500/hM9dOYWPh5pcQ3ruFXDayXsqgHw.jpg','2017-10-13',7.4,0),(23792,'Kidnapping Stella','de','Snatched off the street and held for ransom, a bound and gagged woman uses her limited powers to derail her two masked abductors\' carefully laid plans.','https://image.tmdb.org/t/p/w500/g10YPJa9ePy1kKmTusAeDXBTeAl.jpg','2019-06-29',5.3,0),(23793,'Congo','en','Eight people embark on an expedition into the Congo, a mysterious expanse of unexplored Africa where human greed and the laws of nature have gone berserk. When the thrill-seekers -- some with ulterior motives -- stumble across a race of killer apes.','https://image.tmdb.org/t/p/w500/hPNSToNIIpRO6y5Rh973leqQqNr.jpg','1995-06-09',5.5,0),(23794,'The Parent Trap','en','Two identical twin sisters, separated at birth by their parents\' divorce, are reunited years later at a summer camp, where they scheme to bring their parents back together. The girls, one of whom has been living with their mother and the other with their father, switch places after camp and go to work on their plan, the first objective being to scare off a gold-digger pursuing their father.','https://image.tmdb.org/t/p/w500/jaZFWy6ZAvQoMW2mo9xP5gx4URo.jpg','1961-05-13',7.1,0),(23795,'The Bugs Bunny/Road Runner Movie','en','A collection of Warner Brothers short cartoon features, \"starring\" the likes of Daffy Duck, Porky Pig and Wile.E.Coyote. These animations are interspersed by Bugs Bunny reminiscing on past events and providing links between the individual animations which are otherwise unconnected. This 1979 feature-length compilation includes several of his best cartoons. Among the 11 shorts shown in their entirety are the classics \"Robin Hood Daffy,\" \"What\'s Opera, Doc?,\" \"Bully for Bugs,\" and \"Duck Amuck\". The Bugs Bunny Road Runner Movie provides a showcase not only for Jones\'s razor-sharp timing, but for the work of his exceptional crew, which included designer Maurice Noble, writer Mike Maltese, composers Carl Stalling and Milt Franklyn, and voice actor Mel Blanc.','https://image.tmdb.org/t/p/w500/bf8UBsqg0omm5QxBhEopKoDytvV.jpg','1979-09-30',7.3,0),(23796,'Let Me In','en','A bullied young boy befriends a young female vampire who lives in secrecy with her guardian.  A remake of the movie “Let The Right One In” which was an adaptation of a book.','https://image.tmdb.org/t/p/w500/rgNb9nwPKwV45c5PTvFqFmpzGt0.jpg','2010-10-01',6.8,0),(23797,'Wheels on Meals','cn','Cousins Thomas and David, owners of a mobile restaurant, team up with their friend Moby, a bumbling private detective, to save the beautiful Sylvia, a pickpocket.','https://image.tmdb.org/t/p/w500/dauXY6RPfPRI3kztfOmLq6g16tQ.jpg','1984-08-17',6.9,0),(23798,'Dirty Rotten Scoundrels','en','Two con men try to settle their rivalry by betting on who can be the first to swindle a young American heiress out of $50,000.','https://image.tmdb.org/t/p/w500/3176xH21fSetstKpEtAD1giHbyT.jpg','1988-12-14',7.1,0),(23799,'Sahara','fr','A young cobra and his scorpion best friend go on a journey across the Sahara desert to save a new-found love.','https://image.tmdb.org/t/p/w500/9p8SQYNazWavpMzhN0OIuZm0HgI.jpg','2017-02-01',5.9,0),(23800,'Amateur Night','en','Guy Carter, an insecure expectant father unable to find work in his field, accepts a job driving hookers around Los Angeles. One long and crazy evening proves to our hero that he is, in fact, up to the task of fatherhood.','https://image.tmdb.org/t/p/w500/dzJFu1F0miZKHbR7tRIX6cQcI8c.jpg','2016-08-12',5.6,0),(23801,'Born to Race','en','Born To Race is the story of Danny Krueger, a rebellious young street racer on a collision course with trouble. After an accident at an illegal street race, he is sent to a small town to live with his estranged father, a washed up NASCAR racer. When Danny decides to enter the NHRA High School Drags, he\'s forced to seek his father\'s help in taking down the local hot shot.','https://image.tmdb.org/t/p/w500/Aamkezlj7SEpzdxa84GLvvmgTqq.jpg','2011-03-19',6.8,0),(23802,'High Fidelity','en','When record store owner and compulsive list-compiler Rob Gordon gets dumped by his long-time girlfriend, Laura, because he hasn\'t changed since they met, he revisits his top five breakups of all time in order to figure out what went wrong. As he examines his failed attempts at romance and happiness, the process finds him being dragged, kicking and screaming, into adulthood.','https://image.tmdb.org/t/p/w500/1zgaz1cGdWkNQAriflzlJXf95m7.jpg','2000-03-17',7.1,0),(23803,'Gettysburg','en','In the summer of 1863, General Robert E. Lee leads the Confederate Army of Northern Virginia into Gettysburg, Pennsylvania with the goal of marching through to Washington, D.C. The Union Army of the Potomac, under the command of General George G. Meade, forms a defensive position to confront the rebel forces in what will prove to be the decisive battle of the American Civil War.','https://image.tmdb.org/t/p/w500/566AVv5fwoQTdFy37JXc8QcyDSy.jpg','1993-10-08',6.9,0),(23804,'Big Driver','en','Based on a novella from Stephen King, A famous mystery writer sets out for revenge after a brutal attack.','https://image.tmdb.org/t/p/w500/eOGZagunINGbIMMDXSJnzKJ1Ai4.jpg','2014-10-18',5.7,0),(23805,'City Slickers','en','Three New York businessmen decide to take a \"Wild West\" vacation that turns out not to be the relaxing vacation they had envisioned.','https://image.tmdb.org/t/p/w500/9DVZpm9pQNB3M17cRo752zqUYhL.jpg','1991-06-07',6.4,0),(23806,'The Titan','en','On a bleak future Earth, a soldier endures a radical genetic transformation to save humanity. But his wife fears he\'s becoming more creature than man.','https://image.tmdb.org/t/p/w500/qRmQazyIBZR4pQIk9VruiZul0Au.jpg','2018-03-30',5.4,0),(23807,'My Life as a Zucchini','fr','After his mother’s death, Zucchini is befriended by a kind police officer, Raymond, who accompanies him to his new foster home filled with other orphans his age. There, with the help of his newfound friends, Zucchini eventually learns to trust and love as he searches for a new family of his own.','https://image.tmdb.org/t/p/w500/2uu8fIzl76C9MFiUQhjKYSLKVq.jpg','2016-09-22',7.8,0),(23808,'Boy Missing','es','When her son\'s alleged kidnapper is released for lack of solid evidence, a reputable and well-known attorney takes matters into her own hands with unintended and spectacularly disastrous consequences.','https://image.tmdb.org/t/p/w500/iT4UuE0iJDjkOBVcKftEv7VXblh.jpg','2016-08-19',6.5,0),(23809,'The Pledge','en','A police chief about to retire pledges to help a woman find her daughter\'s killer.','https://image.tmdb.org/t/p/w500/9QOzFL3FPMAUNNPrNiKC3mEDxco.jpg','2001-01-19',6.6,0),(23810,'Tom and Jerry & The Wizard of Oz','en','After a deadly storm, Tom and Jerry find themselves stranded on an unknown island ruled by the evil Wizard of Oz. As they try to find their way back home, they worry for their master Dorothy\'s safety.','https://image.tmdb.org/t/p/w500/gFlwbp47uh6F1p203RQOaxYThzX.jpg','2011-08-23',6,0),(23811,'The Picture of Dorian Gray','en','Posing for a portrait, Dorian Gray talks with Lord Henry Wotton, who says that men should pursue their sensual longings, but laments that only the young get to do so. Taken with the idea, Dorian imagines a scenario in which the painting will age as he stays youthful. His wish comes true, and his boyish looks aid him as he indulges his every whim. But when a stunning revelation forces him to see what he\'s become, Dorian faces some very dangerous questions.','https://image.tmdb.org/t/p/w500/mfvcsmAzdie8YuWI0JpO2u1uzfF.jpg','1945-03-01',7.1,0),(23812,'Heaven & Earth','en','Le Ly lives in a small Vietnamese village whose serenity is shattered when war breaks out. Caught between the Viet Cong and the South Vietnamese army, the village is all but destroyed. After being both brutalized and raped, Le Ly resolves to flee. She leaves for the city, surviving desperate situations, but surviving nonetheless. Eventually she meets a U.S. Marine named Steve Butler who treats her kindly and tells her he would like to be married -- maybe to her.','https://image.tmdb.org/t/p/w500/hvvR7Yf743pc2E2F1VJ2dfZl7OZ.jpg','1993-12-24',6.7,0),(23813,'20th Century Women','en','In 1979 Santa Barbara, California, Dorothea Fields is a determined single mother in her mid-50s who is raising her adolescent son, Jamie, at a moment brimming with cultural change and rebellion. Dorothea enlists the help of two younger women – Abbie, a free-spirited punk artist living as a boarder in the Fields\' home and Julie, a savvy and provocative teenage neighbour – to help with Jamie\'s upbringing.','https://image.tmdb.org/t/p/w500/mso2rEr9i0MilRIOao5HaWFipS9.jpg','2016-12-28',7.3,0),(23814,'Boyhood','en','The film tells a story of a divorced couple trying to raise their young son. The story follows the boy for twelve years, from first grade at age 6 through 12th grade at age 17-18, and examines his relationship with his parents as he grows.','https://image.tmdb.org/t/p/w500/2BvtvDUyxiMJ4dmKfiQf4qdOHQN.jpg','2014-06-05',7.5,0),(23815,'Whiteout','en','The only U.S. Marshal assigned to Antarctica, Carrie Stetko will soon leave the harsh environment behind for good – in three days, the sun will set and the Amundsen-Scott Research Station will shut down for the long winter. When a body is discovered out on the open ice, Carrie\'s investigation into the continent\'s first homicide plunges her deep into a mystery that may cost her her own life.','https://image.tmdb.org/t/p/w500/kkXXA3353MX60B8PRSkTGRabxXu.jpg','2009-09-09',5.5,0),(23816,'The Leopard','it','As Garibaldi\'s troops begin the unification of Italy in the 1860s, an aristocratic Sicilian family grudgingly adapts to the sweeping social changes undermining their way of life. Proud but pragmatic Prince Don Fabrizio Salina allows his war hero nephew, Tancredi, to marry Angelica, the beautiful daughter of gauche, bourgeois Don Calogero, in order to maintain the family\'s accustomed level of comfort and political clout.','https://image.tmdb.org/t/p/w500/riSUxwoK3xjkOgy6YJSvPhi7cO6.jpg','1963-03-28',7.7,0),(23817,'Bad News Bears','en','Morris Buttermaker is a burned-out minor league baseball player who loves to drink and can\'t keep his hands to himself. His long-suffering lawyer arranges for him to manage a local Little League team, and Buttermaker soon finds himself the head of a rag-tag group of misfit players. Through unconventional team-building exercises and his offbeat coaching style, Buttermaker helps his hapless Bears prepare to meet their rivals, the Yankees.','https://image.tmdb.org/t/p/w500/ja1yrgfYAGmwnridioMY3MV0GDm.jpg','2005-07-22',5.9,0),(23818,'Bruce Lee: The Legend','en','The Official Golden Harvest tribute to the Master of the Martial Arts Film, Bruce Lee.','https://image.tmdb.org/t/p/w500/fdD3whXbdfHjlcDNt2oEy6jsxjD.jpg','1984-01-01',8.1,0),(23819,'The Big Sleep','en','Private Investigator Philip Marlowe is hired by wealthy General Sternwood regarding a matter involving his youngest daughter Carmen. Before the complex case is over, Marlowe sees murder, blackmail, deception, and what might be love.','https://image.tmdb.org/t/p/w500/lraHo9D8c0YWfxsKqT5P5sVqMKN.jpg','1946-08-23',7.7,0),(23820,'The Phantom of the Opera at the Royal Albert Hall','en','A disfigured musical genius, hidden away in the Paris Opera House, terrorises the opera company for the unwitting benefit of a young protégée whom he trains and loves. The 25th anniversary of the first public performance of Phantom of the Opera was celebrated with a grand performance at the Royal Albert Hall in London.','https://image.tmdb.org/t/p/w500/1vf1ryVPBSV2J8dOfCmyv3u0Vu4.jpg','2011-09-27',8.5,0),(23821,'August: Osage County','en','A look at the lives of the strong-willed women of the Weston family, whose paths have diverged until a family crisis brings them back to the Midwest house they grew up in, and to the dysfunctional woman who raised them.','https://image.tmdb.org/t/p/w500/fvjxr77dfxdIOY3lvj0bHP4B5xT.jpg','2013-12-26',6.9,0),(23822,'The Odd Life of Timothy Green','en','A childless couple bury a box in their backyard, containing all of their wishes for an infant. Soon, a child is born, though Timothy Green is not all that he appears.','https://image.tmdb.org/t/p/w500/24HWf4QBnEbNYDJfNFR1CmwtST5.jpg','2012-08-15',7,0),(23823,'Streets of Fire','en','Raven Shaddock and his gang of merciless biker friends kidnap rock singer Ellen Aim. Ellen\'s former lover, soldier-for-hire Tom Cody, happens to be passing through town on a visit. In an attempt to save his star act, Ellen\'s manager hires Tom to rescue her. Along with a former soldier, they battle through dangerous cityscapes, determined to get Ellen back.','https://image.tmdb.org/t/p/w500/tmYHBKCZkbmiUfhfOQKgfh0jvXK.jpg','1984-06-01',6.9,0),(23824,'Airheads','en','The Lone Rangers have heavy-metal dreams and a single demo tape they can\'t get anyone to play. The solution: Hijack an FM rock radio station and hold the deejays hostage until they agree to broadcast the band\'s tape.','https://image.tmdb.org/t/p/w500/4xPG8pPMyeoec48gKWbbC85EC8j.jpg','1994-08-05',6.1,0),(23825,'In a Valley of Violence','en','The story of a drifter named Paul who arrives in a small town seeking revenge on the thugs who murdered his friend. Sisters Mary Anne and Ellen, who run the town\'s hotel, help Paul in his quest for vengeance.','https://image.tmdb.org/t/p/w500/j8XBfRFShrYzyp04NW9dSIL6Zm8.jpg','2016-10-21',6.1,0),(23826,'Legend of the Red Dragon','cn','A young father and his infant son are beset by forces of evil and corruption. They wander China, upholding their sense of honor and protecting the weak. When they are forced into combat, spectacular and hilarious fast-motion kung fu sequences follow. In the end, they must call on all of their abilities in a battle royale, to attempt to vanquish a supernatural man-monster or die trying.','https://image.tmdb.org/t/p/w500/57kngzlMiKkn6yg5lDfcxNmcYF4.jpg','1994-02-05',6.7,0),(23827,'La Femme Nikita','fr','A beautiful felon, sentenced to life in prison for the murder of a policeman, is given a second chance - as a secret political assassin controlled by the government.','https://image.tmdb.org/t/p/w500/1ulQDewUG4KKHOhpXdGKm3GdLFq.jpg','1990-02-21',7.1,0),(23828,'Valentine','en','Five friends are stalked by a masked murderer while preparing for Valentine\'s Day.','https://image.tmdb.org/t/p/w500/jMtWV4FixMGTgUjbr9NFVEANGYQ.jpg','2001-02-02',5.4,0),(23829,'A Turtle\'s Tale 2: Sammy\'s Escape from Paradise','en','Sammy and Ray, leatherback turtles and friends forever, are enjoying an atoll\'s water and sand, shepherding new hatchlings Ricky and Ella out to sea. Suddenly, a poacher swoops in and ships them off to be part of a spectacular aquarium show for tourists in Dubai. The kingpin of the place, Big D the seahorse, enlists them in his plans for a great escape. But with their new friends Jimbo the bug-eyed blob fish and Lulu the snippy lobster, Annabel the sweet Octopus, and a whole family of penguins, Sammy and Ray hatch breakout plans of their own. That is when little Ricky and Ella arrive, determined to break in to rescue them. After a series of thrilling adventures and narrow escapes, our heroes head south to meet up with Shelly, Sammy\'s first and only love.','https://image.tmdb.org/t/p/w500/br7BxWeKDKCPExIIN6ePoCLe07z.jpg','2012-08-01',5.8,0),(23830,'Ride On','zh','The once beautiful, now down-and-out Dragon Tiger martial artist Lao Luo lives with his beloved horse, Red Rabbit. Due to a debt dispute involving Red Rabbit, he is faced with the crisis of \"father-son separation\". In desperation, Lao Luo asks his daughter Bao and her boyfriend Naihua, who have misunderstood him for years, for help. On the road of self-help of three people and one horse, they make a lot of jokes and gradually get closer to each other.','https://image.tmdb.org/t/p/w500/k1XBAos93L8lYHhWV3DhP167JHh.jpg','2023-04-07',0,0),(23831,'Unforgettable','en','Julia moves in with her fiancé, David, but his ex-wife and her own haunting past join forces to rock her quiet suburban existence.','https://image.tmdb.org/t/p/w500/jKyjJu3N0bcF9TzcyGLb0Nn6Uqq.jpg','2017-03-06',5.9,0),(23832,'Marvel Studios Assembled: The Making of Moon Knight','en','Join the likes of Oscar Isaac and Ethan Hawke as they reveal how Marvel Studios\' Moon Knight was painstakingly brought to life. Through insightful interviews with cast and crew, along with immersive footage from the set, and a  candid \"roundtable discussion\" with the series\' directors, this \"making-of\" pulls back the curtain on the groundbreaking series of Marvel Studios\' newest hero.','https://image.tmdb.org/t/p/w500/dM6Y4uLzeF4rqbmKBzR0wAsTxby.jpg','2022-05-25',7.3,0),(23833,'Bloodsport II','en','After thief Alex Cardo gets caught while stealing an ancient katana in East Asia, he soon finds himself imprisoned and beaten up by the crowd there. One of the guards, Demon, feels upset by Alex appearance and tortures him as often as he gets the opportunity. Alex finds a friend and mentor in the jailhouse, Master Sun, who teaches him a superior fighting style called Iron Hand. When a \'best of the best kumite\' is to take place, Demon gets an invitation. Now Master Sun and Alex need to find a way to let Alex take part in the kumite too.','https://image.tmdb.org/t/p/w500/xVfSGAbOK4FucTwkYrXJjeBFqv4.jpg','1996-03-01',5.4,0),(23834,'13 Years, 13 Minutes','pl','A story of two boys caught up in the turmoil of the dramatic events of 1956 in Central Europe. At 13, Romek Strzalkowski was the youngest victim of the first workers\' rebellion against Communist authorities in Poland. During \"Black Thursday\" on June 26, he was killed protesting near the UB political police headquarters. Peter Mansfeld was the youngest victim of post-revolt Communist reprisals in Hungary. As a 15-year-old he took part in the Budapest fighting. After the revolution had been quelled by the Soviet army in 1956, he did not give up; he was arrested in 1959 and sentenced to death. Because of the Communists\' cruelty, it took as long as 13 minutes for Peter to die, \"like Jesus Christ on the cross,\" said his Hungarian biographer. The filmmakers analyze the importance of the legend about the two boys who fought against Communism in Poland and Hungary.','https://image.tmdb.org/t/p/w500/ykH1g0D4RMhu8OSgFSuu8IO8xlO.jpg','2008-05-02',10,0),(23835,'Trespass','en','Kyle and Sarah Miller have it all: a huge gated house on the water, fancy cars, and the potential for romance in their relationship. He\'s just back from a business trip and their teen daughter Avery is sneaking out to a party, when four thugs in security uniforms and ski masks stage a home invasion. They want what\'s in the safe: cash and diamonds. As Kyle stalls them, trying to negotiate for Sarah\'s freedom, the fault lines in Kyle and Sarah\'s marriage and the pasts of the four robbers come into play. Is there room here for heroism?','https://image.tmdb.org/t/p/w500/yP60huMcPTWOJfplRLi4FQAEQxX.jpg','2011-10-13',5.5,0),(23836,'Mindhunters','en','Trainees in the FBI\'s psychological profiling program must put their training into practice when they discover a killer in their midst.','https://image.tmdb.org/t/p/w500/uTTGRvnqCI9ZC7WkyP9u7XRiOaA.jpg','2004-05-07',6.5,0),(23837,'Walk Hard: The Dewey Cox Story','en','Following a childhood tragedy, Dewey Cox follows a long and winding road to music stardom. Dewey perseveres through changing musical styles, an addiction to nearly every drug known and bouts of uncontrollable rage.','https://image.tmdb.org/t/p/w500/Aa1IQ4Cuin3d7qIahvPheMmR4E5.jpg','2007-12-21',6.6,0),(23838,'Rainbow','es','In search of her mother, a teenager and her eccentric group of companions set off on a journey, trying to avoid the clutches of a wicked woman.','https://image.tmdb.org/t/p/w500/7RVajiBhqJVwKIhUqSnRWBWhZA5.jpg','2022-09-18',6,0),(23839,'My Awkward Sexual Adventure','en','A hyper-repressed and schlubby accountant (Jonas Chernick) strikes a deal with a worldly but disorganized stripper (Emily Hampshire): he\'ll help her with her crushing debt if she helps him become a better lover.','https://image.tmdb.org/t/p/w500/r5dIFu5i71Ffm0beknmcFyIvfla.jpg','2012-09-11',6.9,0),(23840,'The Doors','en','The story of the famous and influential 1960s rock band and its lead singer and composer, Jim Morrison.','https://image.tmdb.org/t/p/w500/4cr3hbn60Q6ue8r2dpt6IWLOz3f.jpg','1991-03-01',7.1,0),(23841,'The Brown Bunny','en','Bud Clay races motorcycles in the 250cc Formula II class of road racing. After a race in New Hampshire, he has five days to get to his next race in California. During his road trip, he is haunted by memories of the last time he saw Daisy, his true love.','https://image.tmdb.org/t/p/w500/f8HomPJlyPGIWgBODNbWQrRgjxW.jpg','2004-04-07',5.4,0),(23842,'Teenage Mutant Ninja Turtles: Mutant Mayhem','en','After years of being sheltered from the human world in the sewers of New York City, four Turtle brothers, who spent their lives learning ninjitsu, set out to the surface to be accepted as normal teenagers when their new friend April O\'Neil, helps them take on a notorious crime syndicate and an army of mutants.','https://image.tmdb.org/t/p/w500/zT5z66SkONxHlGF1D0wceKqsRdg.jpg','2023-08-02',0,0),(23843,'Crazy Safari','cn','Two guys, one of them a magician, are transporting an ancient chinese vampire who can only be controlled by a series of yellow tapes, and is the ancestor of the other guy. On the way, while flying over Africa, their plane stalls. And of all places, where do they land? That\'s right, in the village of the tribe of \"The Gods Must Be Crazy\".','https://image.tmdb.org/t/p/w500/bULIYu1m6h9aJfV3Odz6k1DbZzc.jpg','1991-07-05',4.8,0),(23844,'Witness for the Prosecution','en','When Leonard Vole is arrested for the sensational murder of a rich, middle-aged widow, the famous Sir Wilfrid Robarts agrees to appear on his behalf. Sir Wilfrid, recovering from a near-fatal heart attack, is supposed to be on a diet of bland, civil suits—but the lure of the criminal courts is too much for him, especially when the case is so difficult.','https://image.tmdb.org/t/p/w500/mM5Cad2ESBprh6ucPnMzMfI34Cu.jpg','1957-12-17',8.2,0),(23845,'Shark Bait','en','After losing everything, a young fish, Pi, goes to live with his family on the Reef. There he meets the love of his life but finds that she already has the unwanted affections of a bully shark. He must follow his destiny to save her and rid the Reef of this menace for good.','https://image.tmdb.org/t/p/w500/xmFSuoUfA1t4xsGKFR6i4kFvmWM.jpg','2006-07-07',5.1,0),(23846,'Adidas Vs. Puma: The Brother\'s Feud','de','Two brothers start a sportswear company in the 1920s, hoping to make the best shoes in the world. Their relationship deteriorates until they become bitter rivals.','https://image.tmdb.org/t/p/w500/tpONaTUC5J8DzoGZ0dKmRtENlwz.jpg','2016-03-25',7.1,0),(23847,'The Firm','en','Mitch McDeere is a young man with a promising future in Law. About to sit his Bar exam, he is approached by \'The Firm\' and made an offer he doesn\'t refuse. Seduced by the money and gifts showered on him, he is totally oblivious to the more sinister side of his company. Then, two Associates are murdered. The FBI contact him, asking him for information and suddenly his life is ruined. He has a choice - work with the FBI, or stay with the Firm. Either way he will lose his life as he knows it. Mitch figures the only way out is to follow his own plan...','https://image.tmdb.org/t/p/w500/kFexXCzidkm4LwlgZqxsJsDQB5v.jpg','1993-06-30',6.7,0),(23848,'Rebecca','en','Story of a young woman who marries a fascinating widower only to find out that she must live in the shadow of his former wife, Rebecca, who died mysteriously several years earlier. The young wife must come to grips with the terrible secret of her handsome, cold husband, Max De Winter. She must also deal with the jealous, obsessed Mrs. Danvers, the housekeeper, who will not accept her as the mistress of the house.','https://image.tmdb.org/t/p/w500/oagejoHmaDRMUo7MpEaihmNohFW.jpg','1940-03-23',7.9,0),(23849,'Tommy Boy','en','To save the family business, two ne’er-do-well traveling salesmen hit the road with disastrously funny consequences.','https://image.tmdb.org/t/p/w500/cUvdzCbhLyYUAwbIkBjT3tC28cK.jpg','1995-03-31',6.8,0),