ld in the US is sent on a covert mission with the promise of a pardon: to go deep into Vietnam and destroy a secret depot of missiles that the US left behind during the pull-out.','https://image.tmdb.org/t/p/w500/vp1qOZJThAGHfrB4uOlmg0JsPvO.jpg','1987-07-09',7.2,0),(23855,'Trust No One: The Hunt for the Crypto King','en','When the young founder of a collapsing cryptocurrency exchange dies unexpectedly, irate investors suspect there\'s more to his death than meets the eye.','https://image.tmdb.org/t/p/w500/2ZzllPVrYmBn28Kc7PZaQ0PrQat.jpg','2022-03-30',6.1,0),(23856,'Gold Run','no','Fredrik isn’t the bravest of men, but now he is faced with a great responsibility and an enormous task - to get the entire Norwegian gold reserve away from the Nazis during the invasion of Norway.','https://image.tmdb.org/t/p/w500/xzP0WmdTac9Pl9hgBqwii9iuTlZ.jpg','2022-12-15',6.4,0),(23857,'The Sisterhood of the Traveling Pants 2','en','Four young women continue the journey toward adulthood that began with \"The Sisterhood of the Traveling Pants.\" Now three years later, these lifelong friends embark on separate paths for their first year of college and the summer beyond, but remain in touch by sharing their experiences with each other.','https://image.tmdb.org/t/p/w500/bAdkVOD91jCHos4163qyVu1TFua.jpg','2008-08-06',6.2,0),(23858,'The Intern - A Summer of Lust','en','The story of Maddie who leaves her hometown in the United States for the sensual streets of Barcelona to seize the opportunity to do an internship for erotic filmmaker Erika Lust. At first, she is overwhelmed by her new life and her new job, the new experiences and people she\'s being confronted with. But soon, sparked by her dreamy roommate Michael and her new friends, the shy All-American girl experiences a sexual awakening she could have never imagined in her wildest dreams. Meanwhile, her sister Paisely is worried about her disappearance and makes it her mission to find her. Will Paisley succeed or will she be lured into the heat of a European summer? This is a tale of sexual awakenings, erotic desire, curiosity and pleasure; this is a summer of Lust.','https://image.tmdb.org/t/p/w500/oqOzSFBksNas2cmHqFBHwuhkug.jpg','2019-12-01',5.2,0),(23859,'Super Me','es','Sang Yu is so exhausted from trying to stay awake. Every time he closes his eyes, a demon chases and kills him in his dreams. One night Sang realizes he has a special power: he can bring treasures from his dreams into reality. Almost overnight, he becomes a rich man. But his wealth also attracts the attention of a ruthless gangster.','https://image.tmdb.org/t/p/w500/tmUsu113NZrHPn68M5s46LlEuDD.jpg','2021-04-09',7.7,0),(23860,'Bruised','en','Jackie Justice is a mixed martial arts fighter who leaves the sport in disgrace. Down on her luck and simmering with rage and regret years after the fight, she\'s coaxed into a brutal underground fight by her manager and boyfriend Desi and grabs the attention of a fight league promoter who promises Jackie a life back in the Octagon. But the road to redemption becomes unexpectedly personal when Manny - the son she gave up as an infant - shows up at her doorstep. A triumphant story of a fighter who reclaims her power, in and out of the ring, when everyone has counted her out','https://image.tmdb.org/t/p/w500/axibOQF9QnThrr8M37ufAYurP4R.jpg','2021-11-17',6.9,0),(23861,'Star Trek II: The Wrath of Khan','en','It is the 23rd century. The Federation Starship U.S.S. Enterprise is on routine training maneuvers and Admiral James T. Kirk seems resigned to the fact that this inspection may well be the last space mission of his career. But Khan is back. Aided by his exiled band of genetic supermen, Khan - brilliant renegade of 20th century Earth - has raided Space Station Regula One, stolen a top secret device called Project Genesis, wrested control of another Federation Starship and sets out in pursuit of the Enterprise, determined to let nothing stand in the way of his mission: kill Admiral Kirk... even 