ng town with his best friend a lovable, sometimes invisible dragon named Elliott! When they are taken in by a kind lighthouse keeper, Nora, and her father, Elliott\'s prank playing lands them in big trouble. Then, when crooked salesmen try to capture Elliott for their own gain, Pete must attempt a daring rescue.','https://image.tmdb.org/t/p/w500/3cJf6kG5x0Qvk0YSXBREpdpTO6Q.jpg','1977-11-03',6.4,0),(23895,'Fatal Journey','zh','The story is set in when Qinghe Nie Sect was dealing with their ancestral knife tomb incident. Nie Mingjue brought Nie Huaisang alone to do good for others by restoring the tomb back to its original state to ensure peace in the Nie sect. Through this, Nie Huaisang went from a playful disciple to maturing into the next generation sect leader and Nie Mingjue learned, understood his brother more and helped him grow.','https://image.tmdb.org/t/p/w500/qNrRDmm595SIZZcrSTq0FEEVPJG.jpg','2020-03-26',7.9,0),(23896,'Bad Genius','th','Lynn, a brilliant student, after helping her friends to get the grades they need, develops the idea of starting a much bigger exam-cheating business.','https://image.tmdb.org/t/p/w500/mgyvwqn5SYKhfg5kofZDfgH8R0q.jpg','2017-05-03',8,0),(23897,'DuckTales: The Movie - Treasure of the Lost Lamp','en','With his nephews and niece, everyone\'s favorite rich uncle, Scrooge McDuck, treks from his mansion home in Duckburg in search of the long-lost loot of the thief Collie Baba. But finding the goods isn\'t quite what it\'s \"quacked\" up to be! Their thrilling adventure leads to comical chaos, magical mayhem, and a lesson about what is far more valuable than money, gold and jewels.','https://image.tmdb.org/t/p/w500/wCvdRynGJQWaOi2qwQP5nDdFxjM.jpg','1990-08-03',6.7,0),(23898,'Bad Company','en','When a Harvard-educated CIA agent is killed during an operation, the secret agency recruits his twin brother.','https://image.tmdb.org/t/p/w500/umu141mcfIEhRLgyQp7TWlGJFW.jpg','2002-06-07',5.4,0),(23899,'Smokin\' Aces 2: Assassins\' Ball','en',