ing in love.','https://image.tmdb.org/t/p/w500/hrdQlicxuyTg3zyVqq78EsA4Z6J.jpg','1984-11-09',6.8,0),(23916,'What If','en','Medical-school dropout Wallace has been repeatedly burned by bad relationships. So while everyone around him, including his roommate Allan, seems to be finding the perfect partner, Wallace decides to put his love life on hold. It is then that he meets Chantry, an animator who lives with her longtime boyfriend Ben. Wallace and Chantry form an instant connection, striking up a close friendship. Still, there is no denying the chemistry between them, leading the pair to wonder, what if the love of your life is actually your best friend?','https://image.tmdb.org/t/p/w500/67x9NJyjK4u02NpISnChDMKzCUr.jpg','2013-09-07',6.7,0),(23917,'Safe Haven','en','A young woman with a mysterious past lands in Southport, North Carolina where her bond with a widower forces her to confront the dark secret that haunts her.','https://image.tmdb.org/t/p/w500/2CbJ3HTb6SFbMeguYH52UQSHOwY.jpg','2013-02-07',7.2,0),(23918,'Dolores Claiborne','en','Dolores Claiborne was accused of killing her abusive husband twenty years ago, but the court\'s findings were inconclusive and she was allowed to walk free. Now she has been accused of killing her employer, Vera Donovan, and this time there is a witness who can place her at the scene of the crime. Things look bad for Dolores when her daughter Selena, a successful Manhattan magazine writer, returns to cover the story.','https://image.tmdb.org/t/p/w500/gfCh3TEQNEoro8lq21y4zYIic4D.jpg','1995-03-24',7.3,0),(23919,'Black Beauty','en','Born free in the American West, Black Beauty is a horse rounded up and brought to Birtwick Stables, where she meets spirited teenager Jo Green. The two forge a bond that carries Beauty through the different chapters, challenges and adventures.','https://image.tmdb.org/t/p/w500/5ZjMNJJabwBEnGVQoR2yoMEL9um.jpg','2020-11-27',8.1,0),(23920,'Evil Black Magic','cn','La Pin, a sinister sorcerer from Thailand who earns money by placing spells of domination on people. Fa La-ting is his zombie murderess, controlled by a metal spike which La Pin has driven into her skull, and rival sorceress Sofia sends her sexually ravenous midget ghosts after Fa to avenge one of the zombie\'s murder victims. The main story line concerns a young man named Ming who pines for a beautiful girl, Chun Yin, and yearns to win her away from her suave boyfriend Wong Wai. Ming goes to Nanyang and becomes the sorcerer La Pin\'s apprentice, picking up enough knowledge to invite the couple to Thailand, and set his plan of enslaving Yin and murdering Wai in motion. After placing the Crazy Love Curse on his intended victim, however, Ming is in over his head, as Wai enlists the aid of the powerful sorceress Sofia to get his beloved Yin back.','https://image.tmdb.org/t/p/w500/e7spAyyiZ0hgdnqq1DneEeytlxL.jpg','1992-01-01',0,0),(23921,'The Blob','en','In Arborville, California, three high school students discover a strange, gelatinous substance that melts the flesh of any living creatures in its path and wreaks havoc across town.','https://image.tmdb.org/t/p/w500/zXXDmz5cPuSo9LveCNjZ1j16szC.jpg','1988-08-05',6.7,0),(23922,'Fame','en','An updated version of the 1980 musical, which centered on the students of the New York Academy of Performing Arts.','https://image.tmdb.org/t/p/w500/hm7f9a0BdjV9OLOJ5wFWQq55Jfd.jpg','2009-09-23',5.7,0),(23923,'The United States vs. Billie Holiday','en','Billie Holiday spent much of her career being adored by fans. In the 1940s, the government targeted Holiday in a growing effort to racialize the war on drugs, ultimately aiming to stop her from singing her controversial ballad, \"Strange Fruit.\"','https://image.tmdb.org/t/p/w500/vEzkxuE2sJcmHYjXQHM8xvR9ICH.jpg','2021-03-31',6.6,0),(23924,'Zog and the Flying Doctors','en','Pearl and Gadabout are now a flying doctor trio, caring for creatures including a mermaid, a unicorn and a sneezy lion. However when bad weather forces them to land