nic predator that ever lived: Carcharodon Megalodon.','https://image.tmdb.org/t/p/w500/fLzlNq3fjNQ64TRRLKlNkrDpYLt.jpg','2004-02-01',4.6,0),(23936,'Gandhi','en','In the early years of the 20th century, Mohandas K. Gandhi, a British-trained lawyer, forsakes all worldly possessions to take up the cause of Indian independence. Faced with armed resistance from the British government, Gandhi adopts a policy of \'passive resistance\', endeavouring to win freedom for his people without resorting to bloodshed.','https://image.tmdb.org/t/p/w500/rOXftt7SluxskrFrvU7qFJa5zeN.jpg','1982-11-30',7.5,0),(23937,'Nocebo','en','A fashion designer hires a nanny from the Philippines to assist her in caring for her family while she is suffering from what she believes is a tick-related illness. The nanny uses traditional Filipino folk healing techniques to help her, but in the process of doing so, she uncovers a horrifying truth about why she is there and why her employer is actually sick.','https://image.tmdb.org/t/p/w500/3FPnDTlX0LsaU4VD5mc82BMbchA.jpg','2022-11-03',6.1,0),(23938,'The Presence','en','In this darkly romantic ghost story, a woman travels to an isolated cabin where she is stalked by an apparition who inhabits her space as his own. With the unexpected arrival of the woman’s boyfriend, the dark spirit’s haunting grows obsessive. Soon the woman begins to exhibit weirdly irrational behavior as the thin line between sanity and possession begins to unravel. Is she battling her inner demons, or is a much darker presence threatening them all?','https://image.tmdb.org/t/p/w500/zJrPVEZ1ZJE4guhxFvHYo7LllbA.jpg','2010-08-04',4.4,0),(23939,'To Live and Die in L.A.','en','A fearless Secret Service agent will stop at nothing to bring down the counterfeiter who killed his partner.','https://image.tmdb.org/t/p/w500/2iW3pSihBIhXjnBQmUJ0mAiZbB5.jpg','1985-11-01',7.1,0),(23940,'The Gift','en','Annie Wilson, young widow and mother of three, makes her living foretelling others\' futures⁠—though