e, forcing a family to make their way across the ice-covered landscape before they are frozen out for good.','https://image.tmdb.org/t/p/w500/6yOakcmbhgV0PXaUvL6iCzxeeb3.jpg','2019-08-07',6.3,0),(23946,'Like & Share','id','Lisa and Sarah, two 17-year-old teenagers, want to be together by accepting each other for who they are. However, everything becomes difficult when Lisa\'s obsession with pornography keeps them away and alone while exploring the light and dark of the teenage world.','https://image.tmdb.org/t/p/w500/mJHBE4REouhFJLR9UKnbRUAW08B.jpg','2022-12-08',8.8,0),(23947,'Clownhouse','en','Three young brothers are terrorized by an evil clown.','https://image.tmdb.org/t/p/w500/l8D1gJCR4zxtgY52TLpzZbMbLBc.jpg','1989-01-01',6.2,0),(23948,'The Muppet Christmas Carol','en','A retelling of the classic Dickens tale of Ebenezer Scrooge, miser extraordinaire. He is held accountable for his dastardly ways during night-time visitations by the Ghosts of Christmas Past, Present and Future.','https://image.tmdb.org/t/p/w500/ssrV29QSVVJuemBHho0Qx7pFYak.jpg','1992-12-10',7.4,0),(23949,'6-Headed Shark Attack','en','What is supposed to be a marriage boot camp on a remote island turns into the ultimate test for survival when a 6-headed shark starts attacking the beach. Trapped with minimal weapons they try to fight off the shark, but quickly discover that no one is safe in the water or on land.','https://image.tmdb.org/t/p/w500/fS37m9pRBG0QYTeCEtzNBVVVL3H.jpg','2018-08-18',4.9,0),(23950,'Arn: The Knight Templar','sv','Arn, the son of a high-ranking Swedish nobleman is educated in a monastery and sent to the Holy Land as a knight templar to do penance for a forbidden love.','https://image.tmdb.org/t/p/w500/kN8C9K9bSQ01lItuEqYzROYErAX.jpg','2007-12-25',6.3,0),(23951,'Working Girl','en','Tess McGill is an ambitious secretary with a unique approach for climbing the ladder to success. When her classy, but villainous boss breaks a leg skiing, Tess takes over her office, her apartment and even her wardrobe. She creates a deal with a handsome investment banker that will either take her to the top, or finish her off for good.','https://image.tmdb.org/t/p/w500/q2jfFzZvAzjTaArQR0tjilIZ5aJ.jpg','1988-12-20',6.6,0),(23952,'Batman Unlimited: Monster Mayhem','en','The Joker is aided in his Halloween quest to render modern technology useless and take over Gotham City by Solomon Grundy, Silver Banshee, Clayface and Scarecrow.','https://image.tmdb.org/t/p/w500/jceXBNFMPLAKlo2MPJGJlXJBQJL.jpg','2015-08-18',6.4,0),(23953,'Homesick','no','When Charlotte, 27, meets her brother Henrik, 35, for the first time as an adult, it becomes an encounter without boundaries, between two people who don\'t know what a normal family is. How does sibling love manifest itself if you have never experienced it before? Homesick is an unusual family drama about seeking a family, and breaking every rule to be one.','https://image.tmdb.org/t/p/w500/aqMfQeWSHJ3uNOOXD4YJR0HoI3d.jpg','2015-03-27',4.7,0),(23954,'Autumn in New York','en','Autumn in New York follows the sexual exploits of Will Keane - New York restaurateur, infamous verging-on-50 playboy, master of the no-commitment seduction - until he runs into an unexpected dead end when he meets Charlotte Fielding. Charlotte is half Will\'s age and twice his match, a 21 year-old free spirit yearning to get out and taste the excitement of adult life.','https://image.tmdb.org/t/p/w500/vmHvrhfYfUZ58RtLaq4LOHp9q5m.jpg','2000-08-11',6.1,0),(23955,'Of Love and Shadows','en','Irene is a magazine editor living under the shadow of the Pinochet dictatorship in Chile. Francisco is a handsome photographer and he comes to Irene for a job. As a sympathizer with the underground resistance movement, Francisco opens her eyes and her heart to the atrocities being committed by the state.','https://image.tmdb.org/t/p/w500/tyg3WAaMa87ln7E1v4AtFkBxYEO.jpg','1994-05-10',5.1,0),(23956,'City of the Living Dead','it','A psychic participates in a séance where she sees a vision of a Dunwich priest hanging himself in a church cemetery, causing her to die of fright. New York City reporter Peter Bell investigates the séance and learns that the priest\'s suicide has somehow opened a portal to Hell and must be sealed by All Saints Day, or else the dead will overtake humanity.','https://image.tmdb.org/t/p/w500/8ymAiDW9ct2GSywWkqATEiKE8OB.jpg','1980-08-11',6.3,0),(23957,'Sudden Impact','en','When a young rape victim takes justice into her own hands and becomes a serial killer, it\'s up to Dirty Harry Callahan, on suspension from the SFPD, to bring her to justice.','https://image.tmdb.org/t/p/w500/zqkQxYFE3G9Oic02SK72gbHRpwe.jpg','1983-12-07',6.6,0),(23958,'McLintock!','en','Ageing, wealthy, rancher and self-made man, George Washington McLintock is forced to deal with numerous personal and professional problems. Seemingly everyone wants a piece of his enormous farmstead, including high-ranking government men, McLintock\'s own sons and nearby Native Americans. As McLintock tries to juggle his various adversaries, his wife—who left him two years previously—suddenly returns. But she isn\'t interested in George; she wants custody of their daughter.','https://image.tmdb.org/t/p/w500/gjaAtWJqGomsE5qNQStHcHhSzES.jpg','1963-11-12',6.6,0),(23959,'Final Analysis','en','A psychiatrist becomes romantically involved with the sister of one of his patients, but the influence of her controlling gangster husband threatens to destroy them both.','https://image.tmdb.org/t/p/w500/5CXRmmLVSLmhLrMSygVBmseR2MU.jpg','1992-02-07',5.7,0),(23960,'Exam','en','The final candidates for a highly desirable corporate job are locked together in an exam room and given a test so simple and confusing that tension begins to unravel.','https://image.tmdb.org/t/p/w500/i1J2zBCyOQJKsQipqJ0qXERC1Ma.jpg','2009-06-19',6.7,0),(23961,'Apollo 11','en','A look at the Apollo 11 mission to land on the moon led by commander Neil Armstrong and pilot Buzz Aldrin.','https://image.tmdb.org/t/p/w500/woLMRroHyoTGoXyxdEeBJEYBFtu.jpg','2019-03-01',7.9,0),(23962,'Ploey: You Never Fly Alone','en','A plover chick has not learned to fly when his family migrates in the fall. He must survive the arctic winter, vicious enemies and himself in order to be reunited with his beloved one next spring.','https://image.tmdb.org/t/p/w500/pQIKecVvsEEexALNuyPj9q4JmSN.jpg','2018-04-12',6.2,0),(23963,'The Giver','en','In a seemingly perfect community, without war, pain, suffering, differences or choice, a young boy is chosen to learn from an elderly man about the true pain and pleasure of the \"real\" world.','https://image.tmdb.org/t/p/w500/ckchcez2u40myIAgkfdVyzofX2T.jpg','2014-08-13',6.5,0),(23964,'Around the World in 80 Days','fr','Passepartout is a young and scholarly marmoset who always dreams of becoming an explorer. One day, he crosses paths with Phileas, a reckless and greedy frog, eager to take on a bet to circumnavigate the globe in 80 days and earn 10 million clams in the process. Seizing the opportunity of a lifetime to explore the world, Passepartout embarks with his new friend on a crazy and exhilarating adventure full of twists and surprises.','https://image.tmdb.org/t/p/w500/pWPTnHtvlmggjGonie1VZNKViLV.jpg','2021-08-04',5.7,0),(23965,'Blue Is the Warmest Color','fr','Adèle\'s life is changed when she meets Emma, a young woman with blue hair, who will allow her to discover desire, to assert herself as a woman and as an adult. In front of others, Adele grows, seeks herself, loses herself, finds herself.','https://image.tmdb.org/t/p/w500/kgUk1wti2cvrptIgUz0VTAtSF6w.jpg','2013-10-09',7.1,0),(23966,'Angel Falls Christmas','en','Ally Morgan is a workaholic ER doctor struggling for work-life balance with boyfriend, Josh. On the night they breakup. Ally is miserable alone before a chance encounter with handsome barista, Gabe leads her to fulfill a Christmas bucket list of fun activities she never would have done on her own. Ally\'s best friend and fellow ER doctor, Dawn has never seen Ally so engaged outside of work and is rooting for a Gabe-Ally relationship. Now, the saintly Maureen must redirect Gabe\'s heartfelt intentions if Josh and Ally have any chance at reconciliation this Christmas.','https://image.tmdb.org/t/p/w500/7A4sPNcTnwtHW2lPaPrKHFVSMON.jpg','2021-11-26',5.7,0),(23967,'The Man Who Shot Liberty Valance','en','A senator, who became famous for killing a notorious outlaw, returns for the funeral of an old friend and tells the truth about his deed.','https://image.tmdb.org/t/p/w500/4C1R0LEivLjbv3swAzJfzh0tzXl.jpg','1962-04-15',7.8,0),(23968,'Snotty Boy','de','1960\'s Siegheilkirchen, a small town in the Austrian hinterland is steeped in reactionary and ultra-Catholic attitudes. The son of a hard-working innkeeper and his wife, called Snotty Boy by all and sundry, is at odds with the narrow-minded confines of his home town. But his unstoppable talent for drawing gives him an outlet for his discontent.','https://image.tmdb.org/t/p/w500/l0DGX7n1X9Jt65heAgE82zkklXs.jpg','2021-09-26',6.2,0),(23969,'Flesh + Blood','en','A band of medieval mercenaries take revenge on a noble lord who decides not to pay them by kidnapping the betrothed of the noble\'s son. As the plague and warfare cut a swathe of destruction throughout the land, the mercenaries hole up in a castle and await their fate.','https://image.tmdb.org/t/p/w500/bjUYC4uC82oASTMPkb6iGCYOO2e.jpg','1985-08-30',6.5,0),(23970,'Arabian Nights','it','The final part of Pasolini\'s Trilogy of Life series is rich with exotic tales of slaves and kings, potions, betrayals, demons and, most of all, love and lovemaking in all its myriad forms. Mysterious and liberating, this is an exquisitely dreamlike and adult interpretation of the original folk tales.','https://image.tmdb.org/t/p/w500/zDrAREfrNvq5O10lHDDh529i143.jpg','1974-06-20',6.7,0),(23971,'Lost and Delirious','en','After starting at an upmarket boarding school, a teenage girl forms close friendships with her two older roommates. However, when she discovers that her new friends are lovers she finds herself caught in a complicated situation.','https://image.tmdb.org/t/p/w500/sPc7lRFLjidXUMX6A7cwaMP9XGT.jpg','2001-01-21',6.9,0),(23972,'Hot Tub Time Machine 2','en','After their first adventure with the \"Hot Tub Time Machine,\" Lou and Nick are living very well off their ill-gotten gains, while Jacob still cannot rely on Lou to be a positive role model. When an unknown assailant breaks into Lou\'s mansion and shoots him, Nick and Jacob take him for another trip in the hot tub. They emerge in the year 2025, where they must figure out who shot Lou and prevent it from happening again.','https://image.tmdb.org/t/p/w500/lBroHetSm8RMI8zp7ThpFJsw9E1.jpg','2015-02-20',5.2,0),(23973,'Requiem for a Dream','en','The hopes and dreams of four ambitious people are shattered when their drug addictions begin spiraling out of control. A look into addiction and how it overcomes the mind and body.','https://image.tmdb.org/t/p/w500/nOd6vjEmzCT0k4VYqsA2hwyi87C.jpg','2000-10-06',8,0),(23974,'The Haunting of Margam Castle','en','A team of American parapsychologists travel to Wales to conduct a study of Margam Castle, one of the UK\'s most haunted buildings.','https://image.tmdb.org/t/p/w500/r2BlIxjAaj0WERGrIehnczNE0On.jpg','2020-09-01',5.6,0),(23975,'Midnight Party','fr','Sylvia, a stripper, attends a party where the theme is a mock spy adventure. Unfortunately, she soon finds herself thrust in a real espionage adventure. There are these two playboys that invite her to their midnight orgy. Later, her communist rock star lover shows up in her dressing room and starts shouting anti-capitalist rhetoric. In the mean time, her hypochondriac husband keeps loosing money in poker games. And in between, she talks directly into the camera, trying to entertain us.','https://image.tmdb.org/t/p/w500/9ILAnXUtRB2yl7JR7V5dlquFfFQ.jpg','1976-01-23',4.7,0),(23976,'Disclosure','en','A computer specialist is sued for sexual 