998,'North Country','en','A fictionalized account of the first major successful sexual harassment case in the United States -- Jenson vs. Eveleth Mines, where a woman who endured a range of abuse while working as a miner filed and won the landmark 1984 lawsuit.','https://image.tmdb.org/t/p/w500/upxUN4zmX79o49mBW9htKZDeNq7.jpg','2005-02-12',7.2,0),(23999,'The Lazarus Effect','en','Medical researcher Frank, his fiancee Zoe and their team have achieved the impossible: they have found a way to revive the dead. After a successful, but unsanctioned, experiment on a lifeless animal, they are ready to make their work public. However, when their dean learns what they\'ve done, he shuts them down. Zoe is killed during an attempt to recreate the experiment, leading Frank to test the process on her. Zoe is revived -- but something evil is within her.','https://image.tmdb.org/t/p/w500/4aq0TOLvITU3iWRUfxlRc83lMz1.jpg','2015-01-29',5.3,0),(24000,'Kill Your Darlings','en','A murder in 1944 draws together the great poets of the beat generation: Allen Ginsberg, Jack Kerouac and William Burroughs.','https://image.tmdb.org/t/p/w500/yswbLHDNm4gdbIk3DVEKT7Yzu4T.jpg','2013-09-19',7.1,0),(24001,'The Jewel of the Nile','en','Joan Wilder is thrust back into a world of murder, chases, foreign intrigue... and love. This time out she\'s duped by a duplicitous Arab dignitary who brings her to the Middle East, ostensibly to write a book about his life. Of course, he\'s up to no good, and Joan is just another pawn in his wicked game. But Jack Colton and his sidekick Ralph show up to help our intrepid heroine save the day.','https://image.tmdb.org/t/p/w500/6VjsIhnIcrz2XdQVHdsMj5DdSa1.jpg','1985-08-01',6.2,0),(24002,'Van Wilder 2: The Rise of Taj','en','Taj Mahal Badalandabad leaves Coolidge College behind for the halls of Camford University in England, where he looks to continue his education, and teach an uptight student how to make the most out of her academic career.','https://image.tmdb.org/t/p/w500/irk5J6IPY4YV4WKrzhwNap8WESn.jpg','2006-12-01',5,0),(24003,'Elizabethtown','en','Drew Baylor is fired after causing his shoe company to lose hundreds of millions of dollars. To make matters worse, he\'s also dumped by his girlfriend. On the verge of ending it all, Drew gets a new lease on life when he returns to his family\'s small Kentucky hometown after his father dies. Along the way, he meets a flight attendant with whom he falls in love.','https://image.tmdb.org/t/p/w500/mOdlzAQxhMgiaazRzif1YtJzg9s.jpg','2005-10-14',6.2,0),(24004,'Emerald Green','de','Emerald Green is the stunning conclusion to Kerstin Gier\'s Ruby Red Trilogy, picking up where Sapphire Blue left off, reaching new heights of intrigue and romance as Gwen finally uncovers the secrets of the time-traveling society and learns her fate.','https://image.tmdb.org/t/p/w500/nls6pTNJo6G52EBTFa5ZRz6NrZ1.jpg','2016-07-07',7,0),(24005,'How I Fell in Love with a Gangster','pl','A mysterious woman recounts the rise and fall of Nikodem \"Nikoś\" Skotarczak, one of the biggest gangsters in Poland\'s history. Inspired by a true story.','https://image.tmdb.org/t/p/w500/e8VV1S1dcFiUBzrbwEZ26uyL40U.jpg','2022-01-05',6.7,0),(24006,'25th Hour','en','In New York City in the days following the events of 9/11, Monty Brogan is a convicted drug dealer about to start a seven-year prison sentence, and his final hours of freedom are devoted to hanging out with his closest buddies and trying to prepare his girlfriend for his extended absence.','https://image.tmdb.org/t/p/w500/uW7tTRElr2tRhmAVESzvHy4ByXg.jpg','2002-12-19',7.4,0),(24007,'El Cid','en','Epic film of the legendary Spanish hero, Rodrigo Diaz (\"El Cid\" to his followers), who, without compromising his strict sense of honour, still succeeds in taking the initiative and driving the Moors from Spain.','https://image.tmdb.org/t/p/w500/a6DY3LDlXFUDuXm47zXTOfiisxP.jpg','1961-10-24',6.9,0),(24008,'The Land Before Time X: The Great Longneck Migration','en','A bedtime story leads Littlefoot and his grandparents on a journey to a new land, where Littlefoot discovers someone who vanished before he was born: his father! Now Littlefoot must decide between two worlds. Will he leave to be with his friends in the Great Valley, or stay behind and start a new life with his father?','https://image.tmdb.org/t/p/w500/lSwUyNrm4KaFwrM5ilY2ZWY5bEL.jpg','2003-12-02',6.3,0),(24009,'Passenger 57','en','An infamous terrorist has evaded capture for a long time by being extremely clever and ruthless. Things get interesting when he hijacks a plane carrying famous security expert John Cutter, who isn\'t about to stand for this sort of thing.','https://image.tmdb.org/t/p/w500/4VBN8pQxGHjeZWcNv1V1xSw0OKC.jpg','1992-11-06',5.9,0),(24010,'I Spy','en','When the Switchblade, the most sophisticated prototype stealth fighter created yet, is stolen from the U.S. government, one of the United States\' top spies, Alex Scott, is called to action. What he doesn\'t expect is to get teamed up with a cocky civilian, World Class Boxing Champion Kelly Robinson, on a dangerous top secret espionage mission. Their assignment: using equal parts skill and humor, catch Arnold Gundars, one of the world\'s most successful arms dealers.','https://image.tmdb.org/t/p/w500/zMgg3txKpggWtTlAkD8xpbbRRCI.jpg','2002-10-31',5.4,0),(24011,'All About Steve','en','After one short date, a brilliant crossword constructor decides that a CNN cameraman is her true love. Because the cameraman\'s job takes him hither and yon, she crisscrosses the country, turning up at media events as she tries to convince him they are perfect for each other.','https://image.tmdb.org/t/p/w500/dn2Hg6uWE3Cytis6YGRH7gZ0MMf.jpg','2009-09-04',4.9,0),(24012,'Acts of Violence','en','When his fiancee is kidnapped by human traffickers, Roman and his ex-military brothers set out to track her down and save her before it is too late. Along the way, Roman teams up with Avery, a cop investigating human trafficking and fighting the corrupt bureaucracy that has harmful intentions.','https://image.tmdb.org/t/p/w500/pK9CugRd3DIP0THBH8WlGrvk5vy.jpg','2018-01-12',5.7,0),(24013,'Scooby-Doo! Moon Monster Madness','en','It\'s one giant step for dog-kind as Scooby-Doo and the Gang blast off for an epic, other-worldly adventure in this all-new original movie! After winning the last 5 seats in a lottery, Scooby-Doo, Shaggy, Fred, Daphne and Velma are off to space in billionaire Sly Baron\'s brand new ship, the Sly Star One. It\'s all gravity-free fun until a mysterious alien begins destroying the ship! As the ship breaks down, the crew is forced to land on Sly Baron\'s base... on the dark side of the moon! Will the gang unravel this alien mystery? Will Scooby-Doo and Shaggy find snacks on the moon? Will Fred ever take his space helmet off?! Journey to the outer limits with Scooby-Doo to find out!','https://image.tmdb.org/t/p/w500/gwyT0ljh8mVViwO6N5p4ACcIsW5.jpg','2015-02-17',7.8,0),(24014,'Paris Memories','fr','Three months after surviving a terrorist attack in a bistro, Mia is still traumatized and unable to recall the events of that night. In an effort to move forward, she investigates her memories and retraces her steps.','https://image.tmdb.org/t/p/w500/5MxWObSox4AgVz0nDSLE54HRGYQ.jpg','2022-09-07',7.3,0),(24015,'Framed by My Husband','en','A woman agrees to help her husband pay off an extortionist, but when the blackmailer is murdered she becomes the prime suspect, and discovers that the man she married has been leading a deadly double life.','https://image.tmdb.org/t/p/w500/kPs3o3EfV1ZfS79JmTKpAO7wVFY.jpg','2021-07-10',5.9,0),(24016,'Bad Times at the El Royale','en','Lake Tahoe, 1969. Seven strangers, each one with a secret to bury, meet at El Royale, a decadent motel with a dark past. In the course of a fateful night, everyone will have one last shot at redemption.','https://image.tmdb.org/t/p/w500/iNtFgXqXPRMkm1QO8CHn5sHfUgE.jpg','2018-10-04',6.8,0),(24017,'The Catholic School','it','Three well-off young men—former students at Rome’s prestigious all-boys Catholic high school San Leone Magno—brutally tortured, raped, and murdered two young women in 1975. The event, which came to be known as the Circeo massacre, shocked and captivated the country, exposing the violence and dark underbelly of the upper middle class at a moment when the traditional structures of family and religion were seen as under threat.','https://image.tmdb.org/t/p/w500/WTTXAtuyQY93oe1yetWYMGbO7K.jpg','2021-10-07',6.2,0),(24018,'Dial M for Murder','en','An ex-tennis pro carries out a plot to have his wife murdered after discovering she is having an affair, and assumes she will soon leave him for the other man anyway. When things go wrong, he improvises a new plan—to frame her for murder instead.','https://image.tmdb.org/t/p/w500/4KKiFDvtEusJzqzlwHp7iMceXKS.jpg','1954-05-29',8,0),(24019,'The Wraith','en','Packard Walsh and his motorized gang control and terrorize an Arizona desert town where they force drivers to drag-race so they can \'win\' their vehicles. After Walsh beats the decent teenager Jamie Hankins to death after finding him with his girlfriend, a mysterious power creates Jake Kesey, an extremely cool motor-biker who has a car which is invincible. Jake befriends Jamie\'s girlfriend Keri Johnson, takes Jamie\'s sweet brother Bill under his wing and manages what Sheriff Loomis couldn\'t; eliminate Packard\'s criminal gang the hard way...','https://image.tmdb.org/t/p/w500/vHrNnqqRYWzkkrJV8MtmUGgC4Kk.jpg','1986-11-21',6.4,0),(24020,'Everybody Wants Some!!','en','A comedy that follows a group of friends as they navigate their way through the freedoms and responsibilities of unsupervised adulthood.','https://image.tmdb.org/t/p/w500/vAIFZ8bw0spSvcIYgfuX99B3H2w.jpg','2016-03-30',6.4,0),(24021,'Goodbye World','en','When a mysterious cyber-attack cripples civilization, a group of old college friends and lovers retreat to a remote country cabin, where they must cope with an uncertain future while navigating the minefield of their shared past.','https://image.tmdb.org/t/p/w500/1WEzts5eapNbxglUSNUXUrs98CR.jpg','2013-06-15',5.4,0),(24022,'Poison Ivy: The New Seduction','en','A sinister seductress vows to destroy a suburban family.','https://image.tmdb.org/t/p/w500/l9Z43sz0qjTrmDjXRlChIVoH1JB.jpg','1997-10-20',4.8,0),(24023,'12 Rounds 3: Lockdown','en','Lockdown Follows a police officer who returns to duty after recovering from a gun shot wound to discover incriminating evidence of illegal activities against those closest to him. He quickly finds himself trapped inside his own precinct, hunted and in search of the truth, as the crooked cops stop at nothing to recover the evidence.','https://image.tmdb.org/t/p/w500/3wAIu7q72mINXVplVnU6pMbZmQQ.jpg','2015-09-11',5.8,0),(24024,'Mackenna\'s Gold','en','A bandit kidnaps a Marshal who has seen a map showing a gold vein on Indian lands, but other groups are looking for it too, while the Apache try to keep the secret location undisturbed.','https://image.tmdb.org/t/p/w500/uChjCbOKpoREb3yZrG1p8L3GyC7.jpg','1969-03-18',6.6,0),(24025,'Inside Job','en','A film that exposes the shocking truth behind the economic crisis of 2008. The global financial meltdown, at a cost of over $20 trillion, resulted in millions of people losing their homes and jobs. Through extensive research and interviews with major financial insiders, politicians and journalists, Inside Job traces the rise of a rogue industry and unveils the corrosive relationships which have corrupted politics, regulation and academia.','https://image.tmdb.org/t/p/w500/8fy2LWdZhfoM4xZ9QbHkjSpGjPX.jpg','2010-10-08',7.7,0),(24026,'Heavy Metal 2000','en','Upon discovery of a shard of what could be the Loc-Nar, a miner named Tyler becomes possessed with an insatiable hunger for power and a thirst for immortality. On his way to the planet of youth, Tyler wipes out most of a space colony and kidnaps a beautiful young woman. His only mistake is that he doesn\'t kill her sister, Julie, who then sets out on a mission of rescue and revenge.','https://image.tmdb.org/t/p/w500/mzOgKYOXiuwE5DIfagFs34bOb3J.jpg','2000-04-19',6.1,0),(24027,'Love, Lost & Found','en','A shallow and slightly clueless social media influencer takes his girlfriend out to the wilderness with the intention of live-streaming \"the most epic proposal ever!\" But things take an unexpected turn after she slips off the edge of a cliff in order to get that perfect shot. It takes being separated in the wild and overcoming nature\'s obstacles for them both to realize they just might not meant for each other...while finding love in new, unexpected places-like an old flame turned Search and Rescue volunteer, and a capable female park ranger.','https://image.tmdb.org/t/p/w500/aguv9VfQLnK8fMXlCbxITdhgAcV.jpg','2023-02-06',0,0),(24028,'Rise','fr','Elise thought she had the perfect life: an ideal boyfriend and a promising career as a ballet dancer. It all falls apart the day she catches him cheating on her with her stage backup; and after she suffers an injury on stage, it seems like she might not be able to dance ever again.  A heartwarming and inspiring story that tells us how sometimes, the worst thing that could happen may turn out to be the best.','https://image.tmdb.org/t/p/w500/ue6GyiX9dLSpmmAze1pPYcIlUrf.jpg','2022-03-30',7.6,0),(24029,'Countdown to Death: Pablo Escobar','es','Through rare interviews, images and wiretap audio, this documentary reconstructs the last nine years of Colombian drug lord Pablo Escobar\'s life.','https://image.tmdb.org/t/p/w500/X0aTsWQ2OWWn3oQiE3CAT2LnyQ.jpg','2017-01-24',6.9,0),(24030,'I Am Bruce Lee','en','Bruce Lee is universally recognized as the pioneer who elevated martial arts in film to an art form, and this documentary will reveal why Bruce Lee\'s flame burns brighter now than the day he died over three decades ago. The greatest martial artists, athletes, actors, directors, and producers in the entertainment business today will share their feelings about the one who started it all. We will interview the people whose lives, careers, and belief systems were forever altered by the legendary \"Father of Martial Arts Cinema\". Rarely seen archival footage and classic photos will punctuate the personal testimonials. Prepare to be inspired.','https://image.tmdb.org/t/p/w500/bvHjKTLFIHOHzl0arxzu2fYtLfR.jpg','2012-02-09',7.8,0),(24031,'No Way Out','en','Navy Lt. Tom Farrell meets a young woman, Susan Atwell , and they share a passionate fling. Farrell then finds out that his superior, Defense Secretary David Brice, is also romantically involved with Atwell. When the young woman turns up dead, Farrell is put in charge of the murder investigation. He begins to uncover shocking clues about the case, but when details of his encounter with Susan surface, he becomes a suspect as well.','https://image.tmdb.org/t/p/w500/93CzsBvRhg035yvQosRtSsTL19v.jpg','1987-08-14',6.9,0),(24032,'Pornography','pl','Two intellectuals, a writer and a director, begin to play a mysterious psychological game in a peaceful countryside manor house during the Nazi occupation.','https://image.tmdb.org/t/p/w500/gzl2NrKKZQvQO6gZ7IvXqaQtj1y.jpg','2003-09-19',5.8,0),(24033,'Eight Legged Freaks','en','The residents of a rural mining town discover that an unfortunate chemical spill has caused hundreds of little spiders to mutate overnight to the size of SUVs. It\'s then up to mining engineer Chris McCormack and Sheriff Sam Parker to mobilize an eclectic group of townspeople, including the Sheriff\'s young son, Mike, her daughter, Ashley, and paranoid radio announcer Harlan, into battle against the bloodthirsty eight-legged beasts.','https://image.tmdb.org/t/p/w500/1hf7x6WmyXtL1MlY4eSlTbZ8Nzu.jpg','2002-07-17',5.7,0),(24034,'Snake in the Eagle\'s Shadow','cn','Everyone abuses and humiliates a downtrodden orphan until he befriends an old man, who turns out to be the last master of the snake fist fighting style. Jackie becomes the old man\'s student and finds himself in battle with the master of the eagle\'s claw style, who has vowed to destroy the snake fist clan.','https://image.tmdb.org/t/p/w500/oCt4990zVSNILSU0Q6DStmdbpIA.jpg','1978-03-01',7.3,0),(24035,'The Lie','en','A father and daughter are on their way to dance camp when they spot the girl\'s best friend on the side of the road. When they stop to offer the friend a ride, their good intentions soon result in terrible consequences.','https://image.tmdb.org/t/p/w500/a3c5zUOIEXAFYFf0vyypBCNJepb.jpg','2018-09-13',6.4,0),(24036,'The Miracle Maker','en','A mother and father in search of help for their sick daughter cross paths with an extraordinary carpenter named Jesus, who has devoted his life to spreading God\'s word. An amazing miracle brings to light the true meaning of Christ, and the sacrifices he endured for the deliverance of mankind. A compelling story of faith, trust, and devotion.','https://image.tmdb.org/t/p/w500/kdloDloT8L5UehG5kMpoSTjfmZl.jpg','2000-03-31',6.1,0),(24037,'You, Me and Dupree','en','After standing in as best man for his longtime friend Carl Petersen, Randy Dupree loses his job, becomes a barfly and attaches himself to the newlywed couple almost permanently -- as their houseguest. But the longer Dupree camps out on their couch, the closer he gets to Carl\'s bride, Molly, leaving the frustrated groom wondering when his pal will be moving out.','https://image.tmdb.org/t/p/w500/rtqbg1CKR4dFdmHxmsiM3u9n71I.jpg','2006-07-13',5.6,0),(24038,'The Last Days on Mars','en','On the last day of the first manned mission to Mars, a crew member of Tantalus Base believes he has made an astounding discovery – fossilized evidence of bacterial life. Unwilling to let the relief crew claim all the glory, he disobeys orders to pack up and goes out on an unauthorized expedition to collect further samples. But a routine excavation turns to disaster when the porous ground collapses and he falls into a deep crevice. His devastated colleagues attempt to recover his body. However, when another vanishes, they start to suspect that the life-form they have discovered is not without danger.','https://image.tmdb.org/t/p/w500/kxcQkAhpn8cvJTsU8PXblI5Qq8F.jpg','2013-08-11',5.4,0),(24039,'Kung Fu Panda 4','en','The further adventures of wide-eyed Po in ancient China, whose love of kung fu is matched only by an insatiable appetite.','https://image.tmdb.org/t/p/w500/43yW06Bm59dtspbeW8OXPmjAVc7.jpg','2024-03-08',0,0),(24040,'Aloha','en','A celebrated military contractor returns to the site of his greatest career triumphs and re-connects with a long-ago love while unexpectedly falling for the hard-charging Air Force watchdog assigned to him.','https://image.tmdb.org/t/p/w500/58Y4CjcRX8AtMNtI0AXu9H7iebP.jpg','2015-05-29',5.5,0),(24041,'The Phantom of the Open','en','Maurice Flitcroft, a dreamer and unrelenting optimist, managed to gain entry to The British Open Golf Championship qualifying in 1976 and subsequently shot the worst round in Open history, becoming a folk hero in the process.','https://image.tmdb.org/t/p/w500/6bcrhJQLoLNsYX4UGTOMQkCiACA.jpg','2022-03-18',6.9,0),(24042,'Backdraft','en','Firemen brothers Brian and Stephen McCaffrey battle each other over past slights while trying to stop an arsonist with a diabolical agenda from torching Chicago.','https://image.tmdb.org/t/p/w500/bymJtYNIdiAiBR1LRetaJXbfryc.jpg','1991-05-24',6.7,0),(24043,'Montana Story','en','Follows two estranged siblings as they return home to the sprawling ranch they once knew and loved.','https://image.tmdb.org/t/p/w500/1DRaBfaVuQyEK9DAurUXZuQqlEp.jpg','2022-05-02',5.7,0),(24044,'Saint Maud','en','Having recently found God, self-effacing young nurse Maud arrives at a plush home to care for Amanda, a hedonistic dancer left frail from a chronic illness. When a chance encounter with a former colleague throws up hints of a dark past, it becomes clear there is more to sweet Maud than meets the eye.','https://image.tmdb.org/t/p/w500/v1ezSfIo5cBORIFnhqYilTFQltE.jpg','2020-10-09',6.7,0),(24045,'The Santa Clause','en','On Christmas Eve, divorced dad Scott Calvin and his son discover Santa Claus has fallen off their roof. When Scott takes the reins of the magical sleigh, he finds he is now the new Santa, and must convince a world of disbelievers, including himself.','https://image.tmdb.org/t/p/w500/hvV2rI60qOYELT7tHHLpxtafnBZ.jpg','1994-11-11',6.5,0),(24046,'Marvel One-Shot: The Consultant','en','Agent Coulson informs Agent Sitwell that the World Security Council wishes Emil Blonsky to be released from prison to join the Avengers Initiative. As Nick Fury doesn\'t want to release Blonsky, the two agents decide to send a patsy to sabotage the meeting...','https://image.tmdb.org/t/p/w500/xqNLXUUvBnfVk6m3QFGGU0Grgs7.jpg','2011-09-13',6.4,0),(24047,'Hands of Stone','en','The legendary Roberto Duran and his equally legendary trainer Ray Arcel change each other\'s lives.','https://image.tmdb.org/t/p/w500/rpAYkkc7ltnxnMXOZLPuI9A6cuB.jpg','2016-08-26',6.3,0),(24048,'The People Under the Stairs','en','Poindexter \"Fool\" Williams, his brother Leroy, and their family face eviction from their rented home in South Central Los Angeles. Their landlords are a greedy, uncaring couple who live in a mansion that\'s as huge as it is eerie. Leroy has a plan to burglarize the mansion, but what the boys find inside is not what they expected.','https://image.tmdb.org/t/p/w500/8OWDBVmGdM7HwaDtbDsdn6Rlzqj.jpg','1991-11-01',6.6,0),(24049,'Grumpy Old Men','en','For decades, next-door neighbors and former friends John and Max have feuded, trading insults and wicked pranks. When an attractive widow moves in nearby, their bad blood erupts into a high-stakes rivalry full of naughty jokes and adolescent hijinks.','https://image.tmdb.org/t/p/w500/iMY7yFn4gMvGaQYMGWnyX2QgvHZ.jpg','1993-12-25',6.6,0),(24050,'The Crucifixion','en','When a priest is jailed for the murder of a nun on whom he was performing an exorcism, an investigative journalist strives to determine whether he in fact murdered a mentally ill person, or if he lost the battle with a demonic presence.','https://image.tmdb.org/t/p/w500/yxTFHGcS0AJab3olU9BjABf5Ogx.jpg','2017-04-27',5.6,0),(24051,'Spooky Buddies','en','Disney\'s irresistible talking puppies are back in an all-new movie that takes them far across town to a mysterious mansion where something very spooky is going on.','https://image.tmdb.org/t/p/w500/iPXai8I7jnEZ4vbNLryV8K8bIOC.jpg','2011-09-20',6.2,0),(24052,'Race','en','Based on the story of Jesse Owens, the athlete whose quest to become the greatest track and field athlete in history thrusts him onto the world stage of the 1936 Olympics, where he faces off against Adolf Hitler\'s vision of Aryan supremacy.','https://image.tmdb.org/t/p/w500/3pKLVyz6LGQU8xEDhYHSHsfy5Bg.jpg','2016-02-19',7.3,0),(24053,'White Girl','en','Summer, New York City. A college girl falls hard for a guy she just met. After a night of partying goes wrong, she goes to wild extremes to get him back.','https://image.tmdb.org/t/p/w500/zBmIjDObX0qMQbTWn3qBAANopUx.jpg','2016-09-02',5.7,0),(24054,'Jackie Chan: Building an Icon','fr','Jackie Chan is a true icon of Asian and Chinese culture. Over a 45-year-long career, he has carved a niche for himself as an actor, stuntman, director, and screenwriter, but also singer and formidable businessman.  After starring in almost 200 films, Chan has reconciled fans of genre film and Hollywood blockbusters, whilst bridging the gap between Asian and Western cinema.  Through film excerpts, archive footage and images, and an offbeat approach inspired by the visual codes of the golden age of kung fu films, this documentary will take a look back at the creation of a popular hero who has come to be an icon for China, and the entire Asian continent.','https://image.tmdb.org/t/p/w500/uPyICQE9RsbRwOwefs3IrRXthpb.jpg','2021-08-04',7.3,0),(24055,'In Darkness','en','A blind musician hears a murder committed in the apartment upstairs from hers that sends her down a dark path into London\'s gritty criminal underworld.','https://image.tmdb.org/t/p/w500/A4gJEE1zpImXE8MYkeq4sB69mfZ.jpg','2018-05-25',6.1,0),(24056,'The Box','en','Norma and Arthur Lewis, a suburban couple with a young child, receive a simple wooden box as a gift, which bears fatal and irrevocable consequences. A mysterious stranger delivers the message that the box promises to bestow upon its owner $1 million with the press of a button. However pressing this button will simultaneously cause the death of another human being somewhere in the world; someone they don\'t know. With just 24 hours to have the box in their possession, Norma and Arthur find themselves in the cross-hairs of a startling moral dilemma and must face the true nature of their humanity.','https://image.tmdb.org/t/p/w500/xMAmOu6xl4CsstixcuecBle9krd.jpg','2009-09-17',5.6,0),(24057,'Thunderbolt and Lightfoot','en','With the help of an irreverent young sidekick, a bank robber gets his old gang back together to organise a daring new heist.','https://image.tmdb.org/t/p/w500/530RZ2HsxAgKVO4joNFjAgucbri.jpg','1974-05-23',6.7,0),(24058,'Endgame','zh','A world-class hitman ends up swapping identities with a down-to-luck extra actor during an accident.','https://image.tmdb.org/t/p/w500/3chxejrvpOU5sAc0vU1xjiyoc7m.jpg','2021-02-12',7.2,0),(24059,'Fantastic Fungi','en','A vivid journey into the mysterious subterranean world of mycelium and its fruit— the mushroom. A story that begins 3.5 billion years ago, fungi makes the soil that supports life, connecting vast systems of roots from plants and trees all over the planet, like an underground Internet.  Through the eyes of renowned mycologist Paul Stamets, professor of forest ecology Suzanne Simard, best selling author Michael Pollan, food naturalist Eugenia Bone and others, we experience the power, beauty and complexity of the fungi kingdom.','https://image.tmdb.org/t/p/w500/giIGfFqirPk3I2azp8Ow98oOnzG.jpg','2019-08-30',7.3,0),(24060,'Black Book','nl','In the Nazi-occupied Netherlands during World War II, a Jewish singer infiltrates the regional Gestapo headquarters for the Dutch resistance.','https://image.tmdb.org/t/p/w500/fKBeM6vjMD79G3wAXSpw3pBHsit.jpg','2006-09-14',7.5,0),(24061,'Bartok the Magnificent','en','Russia is being terrorized by an evil witch known as Baba Yaga; the only one who is not afraid of her is Bartok the Magnificent. Bartok, an albino bat, has just arrived in Moscow and is impressing everyone with his performances, including Prince Ivan Romanov. However, one person is not impressed; Ludmilla finds Bartok annoying and naive. After Bartok\'s show, a violent bear suddenly attacks. Bartok must save everyone by stunning the bear with dust and then knocks him over and traps him in a wagon.','https://image.tmdb.org/t/p/w500/r243zEE7lTd8E6WwbtEGgu5dOs.jpg','1999-11-15',6.1,0),(24062,'Vampires: Los Muertos','en','Tough-as-nails vampire hunter Derek Bliss is on the hunt for \"suckers\" in the heart of Mexico when he receives a new assignment from a mysterious client. Thrown together with a group of slayers, including sexy Zooey, who may or may not be one of the undead. Derek and company are up against a growing number of fast-moving, bloodthirsty vampires and their elusive and powerful leader.','https://image.tmdb.org/t/p/w500/q5kRjaLtYB7mf16FrTrixOWwuWA.jpg','2002-09-23',5.4,0),(24063,'The Biggest Fan','fr','Gérard Lanvin has an important role in a new blockbuster! Filming is about to begin in the South of France. On site, he meets Momo Zapareto, the pool boy at the house he is renting for the duration or the shoot. But Momo is a fan, a big fan… an uberfan! He has seen all his films and is soon doing all he can to make himself indispensable to his idol and the technical crew. For Gérard, the nightmare has just begun…','https://image.tmdb.org/t/p/w500/r7q9yYShODKJBpf6BJH3xA00eh0.jpg','2022-05-18',5.6,0),(24064,'Dangerous Lies','en','After losing her waitressing job, Katie Franklin takes a job as a caretaker to a wealthy elderly man in his sprawling, empty Chicago estate. The two grow close, but when he unexpectedly passes away and names Katie as his sole heir, she and her husband Adam are pulled into a complex web of lies, deception, and murder. If she\'s going to survive, Katie will have to question everyone\'s motives — even the people she loves.','https://image.tmdb.org/t/p/w500/m85QIC42laGfLDxW7DzIFDrWogP.jpg','2020-05-30',6.4,0),(24065,'Dragon Tiger Gate','cn','Dragon Tiger Gate is a 2006 Hong Kong martial arts-action film directed by Wilson Yip and featuring fight choreography by Donnie Yen, who also stars in the film. The film is based on the popular Hong Kong manhua, Oriental Heroes, which bears the same Chinese name as the movie.','https://image.tmdb.org/t/p/w500/pVoNKyIS9eaMqI0wOlDWpxhR1XN.jpg','2006-07-27',6.6,0),(24066,'Black Rain','en','Two New York cops get involved in a gang war between members of the Yakuza, the Japanese Mafia. They arrest one of their killers and are ordered to escort him back to Japan. However, in Japan he manages to escape, and as they try to track him down, they get deeper and deeper into the Japanese Mafia scene and they have to learn that they can only win by playing the game—the Japanese way.','https://image.tmdb.org/t/p/w500/funhGWt9ee3Uwb6Ar8SGCCvbJdV.jpg','1989-09-22',6.6,0),(24067,'Looking Glass','en','A psycho- sexual thriller following a couple that buys an old motel in the desert looking for a new beginning, but what seemed at first as an escape is soon a thrilling ride through a mysterious world when Ray discovers a two way mirror and witnesses a horrifying murder. In a twisted game of cat and mouse, Ray must race to save his wife and himself from a gruesome secret connected to the motel and the strange people who visit there.','https://image.tmdb.org/t/p/w500/6zSzaUmoUCwII2pGTqX1jaX8F0p.jpg','2018-02-16',4.7,0),(24068,'The Grandmaster','cn','Ip Man\'s peaceful life in Foshan changes after Gong Yutian seeks an heir for his family in Southern China. Ip Man then meets Gong Er who challenges him for the sake of regaining her family\'s honor. After the Second Sino-Japanese War, Ip Man moves to Hong Kong and struggles to provide for his family. In the mean time, Gong Er chooses the path of vengeance after her father was killed by Ma San.','https://image.tmdb.org/t/p/w500/ydBVVIscL6TsX5hYztA5YpBCwJ3.jpg','2013-01-10',6.6,0),(24069,'Someone Great','en','An aspiring music journalist lands her dream job and is about to move to San Francisco when her boyfriend of nine years decides to call it quits. To nurse her broken heart, she and her two best friends spend one outrageous last adventure in New York City.','https://image.tmdb.org/t/p/w500/tENpQ0eU2fDhsh6HyPv9O1GddBW.jpg','2019-04-19',6.4,0),(24070,'The Battle at Lake Changjin','zh','Korean War, winter 1950. In the frozen and snowy area of Changjin Lake, a bloody battle is about to begin between the elite troops of the United States and China.','https://image.tmdb.org/t/p/w500/5q22mBfsFVvtxscYI52dicYchuK.jpg','2021-09-30',6.3,0),(24071,'Tully','en','Marlo, a mother of three, including a newborn, is gifted a night nanny by her brother. Hesitant at first, she quickly forms a bond with the thoughtful, surprising, and sometimes challenging nanny named Tully.','https://image.tmdb.org/t/p/w500/wDI4YXBXolMYi15Qx2kClvdSERM.jpg','2018-05-04',6.8,0),(24072,'Red Sun','fr','In 1870, Japanese ambassador Sakaguchi and his entourage travel by train to Washington to deliver a valuable sword to the President of the United States, a gift from the Emperor of Japan. On board the same train are two robbers, Link and Gauche, ready to make their move…','https://image.tmdb.org/t/p/w500/hDQyx0N8J5OJMJYpJLIX0SkKwT4.jpg','1971-09-15',6.9,0),(24073,'Cats','zh','A cat named Blanket has long been living in a high-rise apartment in the city with his son, Cloak. One day, curious about the outside world, Cloak decides to leave home and embarks on an adventure to find the legendary cat\'s paradise. To find his son, Blanket must overcome his fear and reconcile with his past, with the help of a female Macaw.','https://image.tmdb.org/t/p/w500/lsZheNTApIa1nrgBWzw90gXdy3Y.jpg','2018-04-05',6.8,0),(24074,'The Big Bad Fox and Other Tales','fr','The countryside isn\'t always as calm and peaceful as it\'s made out to be, and the animals on this farm are particularly agitated: a fox who mothers a family of chicks, a rabbit who plays the stork, and a duck who wants to be Santa Claus.','https://image.tmdb.org/t/p/w500/3Nib5a3p2O7yPFSTTNwChp0cnsh.jpg','2017-06-21',7.7,0),(24075,'The Guide to the Perfect Family','fr','A couple in Québec deals with the pitfalls, pressure and high expectations of raising kids in a society obsessed with success and social media image.','https://image.tmdb.org/t/p/w500/cBhkSwZpb3QpUwFuFdWAXTqWAtS.jpg','2021-07-14',6.5,0),(24076,'Crimes of Passion','en','Joanna Crane lives a double life. During the day she works as fashion designer but during the night she is the high class prostitute China Blue. As she is accused for industrial spying, Bobby Grady is hired to shadow her. However, they fall in love.  Meanwhile a psychopathic preacher starts stalking her.','https://image.tmdb.org/t/p/w500/tstF6JMrZe75AdEAoPejwPrDfMA.jpg','1984-10-19',6.5,0),(24077,'In the Blood','en','When her husband goes missing during their Caribbean vacation, a woman sets off on her own to take down the men she thinks are responsible.','https://image.tmdb.org/t/p/w500/zLqmFJWiXnkhKFmx1dbsARwNWgu.jpg','2014-04-04',5.9,0),(24078,'The Swan Princess: The Mystery of the Enchanted Kingdom','en','The royal couple Odette and Derek face yet another evil magician, this time a woman named Zelda. Lusting for the treasure of the Forbidden Arts, which will give her absolute power, Zelda kidnaps Odette as ransom. Derek and several animal friends head off to rescue Odette','https://image.tmdb.org/t/p/w500/wgz5mA3FCjWZUAxNuUI0UR69CqG.jpg','1998-08-04',6,0),(24079,'The Boat That Rocked','en','The Boat That Rocked is an ensemble comedy, where the romance is between the young people of the 60s, and pop music. It\'s about a band of DJs that captivate Britain, playing the music that defines a generation and standing up to a government that  wanted control of popular culture via the British Broadcasting Corporation. Loosely based on the events in Britain in the 60\'s when the Labour government of Harold Wilson, wanted to bring the pirate radio stations under control, enough to see the passage of the Marine Broadcasting Offences Act on 15 August 1967. Also known as \"Pirate Radio\".','https://image.tmdb.org/t/p/w500/l7CBRLAXUnHi0kp2krhLtlJvtWI.jpg','2009-04-01',7.2,0),(24080,'The Guest','es','Alicia and Enrique are a young married couple somewhat distanced from each other. Their relationship is threatened when Carlota, a friend of Alicia\'s from long ago, comes to visit and stays with them for a while.','https://image.tmdb.org/t/p/w500/w2Pv2KEtbGNkiPitDZrncQmdNzS.jpg','2021-07-22',4,0),(24081,'Yoga Hosers','en','Two teenage yoga enthusiasts team up with a legendary man-hunter to battle with an ancient evil presence that is threatening their major party plans.','https://image.tmdb.org/t/p/w500/gagGVLhJzhvVhprOcwtSf4B6MeF.jpg','2016-07-08',4.6,0),(24082,'Alexander and the Terrible, Horrible, No Good, Very Bad Day','en','Alexander\'s day begins with gum stuck in his hair, followed by more calamities. Though he finds little sympathy from his family and begins to wonder if bad things only happen to him, his mom, dad, brother, and sister all find themselves living through their own terrible, horrible, no good, very bad day.','https://image.tmdb.org/t/p/w500/7BVEl2hP21VZ1ymsXlCeoH1fBG8.jpg','2014-10-08',6.2,0),(24083,'The Breed','en','Brothers John and Matt have inherited an island cabin from their recently deceased uncle. Along with Matt\'s girlfriend, Nicki, and other mutual friends, the siblings travel to the cabin for a relaxing weekend getaway. But, not long after arriving, the group is besieged by ravenous dogs. They watch in horror as another vacationer, Luke, is eaten alive. Soon, they discover a training facility where the dogs have been bred to kill.','https://image.tmdb.org/t/p/w500/7o3W290glYDaW4d79pdo1LXdxSc.jpg','2006-05-17',5.3,0),(24084,'My Left Foot: The Story of Christy Brown','en','In this true story told through flashbacks, Christy Brown is born with crippling cerebral palsy into a poor, working-class Irish family. Able only to control movement in his left foot and to speak in guttural sounds, he is mistakenly believed to have a intellectual disability for the first ten years of his life.','https://image.tmdb.org/t/p/w500/GRAAl0bMQFoFIjV3aunc5jsM5u.jpg','1989-04-07',7.5,0),(24085,'Drive','hi','A getaway driver is attracted to a female neighbor whose husband owes money to a local gangster. As a result he is drawn deeper into a dangerous underworld.','https://image.tmdb.org/t/p/w500/1ZUNyvVGTPkeBVXXTMnhIRoXlfo.jpg','2019-11-01',5.3,0),(24086,'Tramite amicizia','it','','https://image.tmdb.org/t/p/w500/recKwxihF2TFLPHlSYpNPMsLuWi.jpg','2023-02-14',0,0),(24087,'The Volcano: Rescue from Whakaari','en','A close examination of the Whakaari / White Island volcanic eruption of 2019 in which 22 lives were lost, the film viscerally recounts a day when ordinary people were called upon to do extraordinary things, placing this tragic event within the larger context of nature, resilience, and the power of our shared humanity.','https://image.tmdb.org/t/p/w500/7LQUp64Ub9JfnLVuzyhEHdc7DBg.jpg','2022-11-03',7.4,0),(24088,'Blood and Money','en','A retired veteran hunting in the Allagash backcountry of Maine discovers a dead woman with a duffle bag full of money. He soon finds himself in a web of deceit and murder.','https://image.tmdb.org/t/p/w500/st4n0FALlo0twLkSqxAvU15SKvU.jpg','2020-05-15',5.4,0),(24089,'The Great Beauty','it','Jep Gambardella has seduced his way through the lavish nightlife of Rome for decades, but after his 65th birthday and a shock from the past, Jep looks past the nightclubs and parties to find a timeless landscape of absurd, exquisite beauty.','https://image.tmdb.org/t/p/w500/1cmOc3ZPkuCTOTqHEsRr3Pk81Um.jpg','2013-05-21',7.5,0),(24090,'Phineas and Ferb: Mission Marvel','en','Phineas and Ferb team up with the Avengers to save the world from Dr. Doofenshmirtz and a group of dangerous supervillains.','https://image.tmdb.org/t/p/w500/da2AREjdecPInHzWeZ550X1aYDU.jpg','2013-08-16',6.6,0),(24091,'Last Year at Marienbad','fr','In a strange and isolated chateau, a man becomes acquainted with a woman and insists that they have met before.','https://image.tmdb.org/t/p/w500/tizZ7JnXRFMvoNegu2CtM2ab9E7.jpg','1961-05-25',7.5,0),(24092,'God of Gamblers','cn','Ko Chun, an extremely talented and well known gambler. On the eve of a big confrontation with a famous Singaporean gambler, Ko walks into a trap set by Knife, an avid but a so-so gambler, meant for an Indian servant. Struck on the head, Ko suffers from amnesia and regresses to a child-like state. Knife takes care of Ko and begins to exploit Ko\'s gambling talents.','https://image.tmdb.org/t/p/w500/lmAVK6B4uR8xgYTytjvAfoLuEBG.jpg','1989-12-14',7.1,0),(24093,'Trees of Peace','en','In April of 1994, four women from different backgrounds and beliefs are trapped and hiding during the Rwandan genocide. Their fight for survival against all odds unites the women in an unbreakable sisterhood.','https://image.tmdb.org/t/p/w500/2McwkzqZ5uOZsBOGEjCDRni8Qf7.jpg','2021-04-01',7.4,0),(24094,'Annie','en','Things seem pretty bad for a young girl living a \"hard-knock life\" in an orphanage. Fed up with the dastardly Miss Hannigan, Annie escapes the run-down orphanage determined to find her mom and dad. It\'s an adventure that takes her from the cold, mean streets of New York to the warm, comforting arms of bighearted billionaire Oliver Warbucks - with plenty of mischief and music in between.','https://image.tmdb.org/t/p/w500/y0XWZC1A7PbWf1gwmvbvhY9uWM2.jpg','1999-11-07',6.4,0),(24095,'Creature from the Black Lagoon','en','When scientists exploring the Amazon River stumble on a “missing link” connecting humans and fish, they plan to capture it for later study. But the Creature has plans of his own, and has set his sights on the lead scientist\'s beautiful fiancée, Kay.','https://image.tmdb.org/t/p/w500/euCzA2Exc70MpTDCVYih8tdE7z1.jpg','1954-03-05',6.9,0),(24096,'Take Down','en','Sons and daughters of international billionaires are sent to an boot camp where they are taught basic survival skills in hopes it will teach them responsibility. When they are taken hostage and taken for ransom by kidnappers, they will need to utilize every skill they learned to survive.','https://image.tmdb.org/t/p/w500/yTfzOGKAKRqsvXToImspDlOGHaa.jpg','2016-05-05',5.9,0),(24097,'Daughter of the Wolf','en','Ex-military specialist Clair Hamilton returns home from her tour in the Middle East due to her father\'s passing and to claim her inheritance. Her son is then kidnapped and held for ransom by a gang led by a mysterious figure known only as “Father”.','https://image.tmdb.org/t/p/w500/ghoNQkJX9Hk1m8GxTsBg4Xez1gn.jpg','2019-06-14',5.7,0),(24098,'Horns','en','In the aftermath of his girlfriend\'s mysterious death, a young man awakens to strange horns sprouting from his temples.','https://image.tmdb.org/t/p/w500/9wLBYgIEqkEyObJukAt4aodOqWr.jpg','2013-09-06',6.3,0),(24099,'K-19: The Widowmaker','en','When Russia\'s first nuclear submarine malfunctions on its maiden voyage, the crew must race to save the ship and prevent a nuclear disaster.','https://image.tmdb.org/t/p/w500/ji7YWKx40TM8YexbRqfJZKMhQY3.jpg','2002-07-19',6.5,0),(24100,'Black Box','fr','Matthieu is a young and talented black box analyst on a mission to solve the reason behind the deadly crash of a brand new aircraft. Yet, when the case is closed by authorities, Matthieu cannot help but sense there is something wrong with the evidence. As he listens to the tracks again, he starts detecting some seriously disturbing details. Could the tape have been modified? Going against his boss\' orders, Matthieu begins his own rogue investigation - an obsessional and dangerous quest for truth that will quickly threaten far more than his career...','https://image.tmdb.org/t/p/w500/gIYxQoxQC78kQBxIKCR41hheqwb.jpg','2021-09-08',7.4,0),(24101,'Waking Life','en','Waking Life is about a young man in a persistent lucid dream-like state. The film follows its protagonist as he initially observes and later participates in philosophical discussions that weave together issues like reality, free will, our relationships with others, and the meaning of life.','https://image.tmdb.org/t/p/w500/2MRM4PL6H7yraAkwyUEe2EqoQH3.jpg','2001-10-19',7.5,0),(24102,'It Comes at Night','en','Secure within a desolate home as an unnatural threat terrorizes the world, a man has established a tenuous domestic order with his wife and son, but this will soon be put to test when a desperate young family arrives seeking refuge.','https://image.tmdb.org/t/p/w500/rNKJpFMlOZn5zkzBPZxEJrQn5Km.jpg','2017-06-09',5.8,0),(24103,'The Skeleton Key','en','A hospice nurse working at a spooky New Orleans plantation home finds herself entangled in a mystery involving the house\'s dark past.','https://image.tmdb.org/t/p/w500/sH7mDPlWwFTqVUg6yKRvToCMH3B.jpg','2005-07-29',6.6,0),(24104,'Black Sheep','en','A genetic engineering experiment gone horribly awry turns a large flock of docile sheep into unrelenting killing machines.','https://image.tmdb.org/t/p/w500/b6Spp82Tg8rv4YUSHGWFqFbgp0q.jpg','2007-03-29',5.7,0),(24105,'Freibad','de','It\'s summer and very hot in Germany\'s only open-air swimming pool for women. There, women bathe topless, in a bikini, bathing suit or burkini. Each follows different rules. This always leads to friction, which the overwhelmed lifeguard is not quite able to control. When a group of completely veiled women enthusiastically discovers the women\'s bath for themselves, rags literally fly: Who owns the bath and who makes the rules? Who owns the female body? And when is a woman a woman at all? The lifeguard resigns, exasperated. But when a man of all people is hired as the successor as lifeguard, the situation escalates in unpredictable directions.','https://image.tmdb.org/t/p/w500/dSP5JIDKtuQDQ84CecRnleTFMiu.jpg','2022-09-01',4.3,0),(24106,'The Vanished','en','A family vacation takes a terrifying turn when parents Paul and Wendy discover their young daughter has vanished without a trace. Stopping at nothing to find her, the search for the truth leads to a shocking revelation.','https://image.tmdb.org/t/p/w500/bYePSWEmMw9PQ9hNwMzgW1rQUtI.jpg','2020-08-21',6.1,0),(24107,'Black Death','en','As the plague decimates medieval Europe, rumours circulate of a village immune from the plague. There is talk of a necromancer who leads the village and is able to raise the dead. A fearsome knight joined by a cohort of soldiers and a young monk are charged by the church to investigate. Their journey is filled with danger, but it\'s upon entering the village that their true horror begins.','https://image.tmdb.org/t/p/w500/gXRERDpyT9s3m2yk6wNmrTWbZfG.jpg','2010-06-07',6,0),(24108,'Love Hard','en','An LA girl, unlucky in love, falls for an East Coast guy on a dating app and decides to surprise him for Christmas, only to discover that she\'s been catfished. But the object of her affection actually lives in the same town, and the guy who duped her offers to set them up if she pretends to be his own girlfriend for the holidays.','https://image.tmdb.org/t/p/w500/oTkAFDZRLnqrXOrOwuy3Tvul0v5.jpg','2021-11-05',7,0),(24109,'The Bounty Hunter','en','A revered bounty hunter\'s latest gig is rather satisfying, as his bail-skipper is his ex-wife, who has no intention of getting nabbed without a fight.','https://image.tmdb.org/t/p/w500/fJPKar0jnAsS09l3xfP6LL8sUkX.jpg','2010-03-16',5.8,0),(24110,'High Lane','fr','A group of friends on a climbing vacation ignore warnings that the mountains are closed and start their ascent anyway. Collapsing bridges, bear traps and other dangers threaten to splinter the group… when the real hell begins and an unseen villain begins picking them off one by one.','https://image.tmdb.org/t/p/w500/sbZEfldNNGOBxEs81LFoUwLh8LV.jpg','2009-06-24',6.1,0),(24111,'Love on the Sidelines','en','A down-on-her-luck young woman who falls into a job as a personal assistant to a star quarterback sidelined with an injury. He\'s never had a female assistant before and she knows nothing about football.','https://image.tmdb.org/t/p/w500/oPFXIYMzOX7LebQT53Bxc0R1eug.jpg','2016-01-16',6.3,0),(24112,'Sissi: The Young Empress','de','Sissi is now the empress of Austria and attempts to learn etiquette. While she is busy being empress she also has to deal with her difficult new mother-in-law, while the arch-duchess Sophie is trying to tell the emperor how to rule and also Sissi how to be a mother.','https://image.tmdb.org/t/p/w500/unU4KPyXKpdNz51QmyiaQ9hrgOC.jpg','1956-12-01',7.2,0),(24113,'Palm Swings','en','After moving to Palm Springs, a young married couple puts their love to the test when they discover that their neighbors are swingers.','https://image.tmdb.org/t/p/w500/g1YnKSZECx2mfCheJmmQOX3CaDn.jpg','2017-10-03',6.5,0),(24114,'Alien: Covenant - Prologue: Last Supper','en','A prologue short to Alien: Covenant, it takes place aboard the Covenant, a Weyland colonization ship on its way to a remote planet to form a new human settlement.  Before the crew is set to enter hypersleep, the 14 crew members (all couples) and their android, Walter, enjoy a final meal together.','https://image.tmdb.org/t/p/w500/vwEFzUzhKrc2PP1El7DQjcLW3f7.jpg','2017-02-22',6,0),(24115,'The Numbers Station','en','When the moral values of a longtime wetwork black ops agent is tested during his last operation, he receives an unfavorable psych evaluation. Now he is given a break and a seemingly uncomplicated assignment of simply protecting the security of a young female code announcer, code resources and remote station they are assigned to. After an ambush and one phone call later, it becomes a complicated fight for their survival.','https://image.tmdb.org/t/p/w500/bcpaJ2JYM2WKzzuRUAB869uMWnK.jpg','2013-04-18',5.5,0),(24116,'Chocolat','en','A mother and daughter move to a small French town where they open a chocolate shop. The town, religious and morally strict, is against them, as they represent free-thinking and indulgence. When a group of Boat Gypsies float down the river, the prejudice of the Mayor leads to a crisis.','https://image.tmdb.org/t/p/w500/jPNmQq23eNbKFVPZnY5Kxc63MvW.jpg','2000-03-02',7,0),(24117,'The Visitors','fr','This outrageous time-travel comedy follows the misadventures of a wacky medieval knight (Jean Reno) and his faithful servant when they are accidentally transported to contemporary times by a senile sorcerer. Mayhem rules as these 12th-century visitors try adapting to the wildly confusing modern world. To avoid being stuck here for good, however, they soon begin an all-out cosmic assault on their former castle -- now a luxury hotel -- in their quest to return to the past.','https://image.tmdb.org/t/p/w500/hPCq0buG5PaXgKjzT2ktjrjlpbj.jpg','1993-01-27',7.1,0),(24118,'Feast','en','Trapped in a remote tavern, a group of strangers must band together for survival. Outside the bar, a horde of ravenous, flesh-eating monsters are trying to break in and dine on the frightened humans inside.','https://image.tmdb.org/t/p/w500/61RknsRLF5YT1gIgSCVv4qbTt8C.jpg','2005-10-14',6.2,0),(24119,'The Gold Rush','en','A lone prospector ventures into Alaska looking for gold. He soon gets mixed up with some burly characters, falls in love with the beautiful Georgia, and tries to win her heart with his singular charm.','https://image.tmdb.org/t/p/w500/eQRFo1qwRREYwj47Yoe1PisgOle.jpg','1925-07-12',8,0),(24120,'South Park: The 25th Anniversary Concert','en','Trey Parker and Matt Stone celebrate South Park\'s 25th anniversary with a concert in Colorado, featuring Primus and Ween.','https://image.tmdb.org/t/p/w500/w5sVLPVpFuIVdJ1M5Mf9u0YOiOu.jpg','2022-08-13',7.8,0),(24121,'Malvada','es','A desperate mother contacts his son\'s ex-girlfriend to tell her that he\'s about to marry a wicked witch.','https://image.tmdb.org/t/p/w500/c6UyPizukdYnCoyoYc5xBGvZN2V.jpg','2022-12-29',2,0),(24122,'An Action Hero','hi','Youth Icon. Superstar. Action Hero. At the age of just 30, Maanav was at the peak of his career when he got caught up in an accident while filming in Mandothi village in Haryana. Maanav, who was once a household name, is now living in hiding.','https://image.tmdb.org/t/p/w500/92hQUSB4vqkOH97znKLD8YFheZB.jpg','2022-12-02',6.1,0),(24123,'A Good Man','en','After an illustrious special ops career ends in disaster, Alexander goes off the grid and attempts to lead a quiet life as a handyman at an apartment complex. But when one of his tenants and her family fall under the thumb of a Russian gangster, Alexander is dragged into an all-out war between rival Chinese and Russian gangs; forcing him to not only defend the family, but bringing him face to face with an old foe, and giving him one more chance to reconcile his past.','https://image.tmdb.org/t/p/w500/i8ZAST0OBH6bSdZSdQbviQxh2CT.jpg','2014-08-19',5.1,0),(24124,'The Babysitter','en','Jennifer (Alicia Silverstone) is a lovely teen who has been hired to baby-sit the kids of Harry Tucker (J.T. Walsh) and his wife, Dolly (Lee Garlington). The Tuckers go to a party and proceed to get inebriated, with Mr. Tucker fantasizing about his beautiful baby sitter. Meanwhile, Jack (Jeremy London), her boyfriend, and Mark (Nicky Katt), another guy interested in her, decide to spy on Jennifer at the Tucker house, with each young man also fixated on her.','https://image.tmdb.org/t/p/w500/wOv6HKiKTcDiyZRXPOsjm2JhVZV.jpg','1995-10-17',5.3,0),(24125,'Messengers 2: The Scarecrow','en','The family man farmer John Rollins is stressed with his financial situation: the crows and the lack of irrigation are destroying his crop of corn; the bank is near closure of his mortgage; he does not have credit to fix the water pump or to buy seeds; and his marriage is in crisis and his wife Mary is giving too much attention to her friend Tommy. When John accidentally discovers a hidden compartment in the barn, he finds a creepy scarecrow but his son Michael makes him promise to destroy it. However, his neighbor Jude Weatherby visits him, gives a six-pack of beer to the abstemious John and convinces him to put the scarecrow in the cornfield. Out of the blue, the life of John changes: the crows die; the pump works again irrigating the land; and the banker responsible for the closure has an accident and dies. However, he feels that his land is possessed by something evil that is threatening his beloved family.','https://image.tmdb.org/t/p/w500/xav4wnkLQiVAUTVxNPMKrXTBdkf.jpg','2009-07-21',5.4,0),(24126,'The Client','en','A street-wise kid, Mark Sway, sees the suicide of Jerome Clifford, a prominent Louisiana lawyer, whose current client is Barry \'The Blade\' Muldano, a Mafia hit-man. Before Jerome shoots himself, he tells Mark where the body of a Senator is buried. Clifford shoots himself and Mark is found at the scene, and both the FBI and the Mafia quickly realize that Mark probably knows more than he says.','https://image.tmdb.org/t/p/w500/oLdkJ4ZjxPtFSUChdjDQvHM9l75.jpg','1994-07-20',6.7,0),(24127,'Hamburger Hill','en','The men of Bravo Company are facing a battle that\'s all uphill… up Hamburger Hill. Fourteen war-weary soldiers are battling for a mud-covered mound of earth so named because it chews up soldiers like chopped meat. They are fighting for their country, their fellow soldiers and their lives. War is hell, but this is worse. Hamburger Hill tells it the way it was, the way it really was. It\'s a raw, gritty and totally unrelenting dramatic depiction of one of the fiercest battles of America\'s bloodiest war. This happened. Hamburger Hill - war at its worst, men at their best.','https://image.tmdb.org/t/p/w500/a84FDoIm64qcyKq6BEMB9Ycldpt.jpg','1987-08-07',6.5,0),(24128,'Life After Beth','en','Zach is devastated by the unexpected death of his girlfriend, Beth. When she mysteriously returns, he gets a second chance at love. Soon his whole world turns upside down...','https://image.tmdb.org/t/p/w500/4ZQ8LoU9SwSxSrmc3aOtHmruk26.jpg','2014-08-15',5.5,0),(24129,'A Teacher','en','A high school teacher in Austin, Texas takes sexual advantage over one of her students. Her life begins to unravel as the details of the relationship are exposed.','https://image.tmdb.org/t/p/w500/sCsK0oCKyz8yQ3xCG7NgYlg9qBW.jpg','2013-09-06',4.7,0),(24130,'Shall We Dance?','en','Upon first sight of a beautiful instructor, a bored and overworked estate lawyer signs up for ballroom dancing lessons.','https://image.tmdb.org/t/p/w500/aGIyiQv08Gw1HO5BV1yrwCWtGHC.jpg','2004-10-15',6.4,0),(24131,'Sneakers','en','When shadowy U.S. intelligence agents blackmail a reformed computer hacker and his eccentric team of security experts into stealing a code-breaking \'black box\' from a Soviet-funded genius, they uncover a bigger conspiracy. Now, he and his \'sneakers\' must save themselves and the world economy by retrieving the box from their blackmailers.','https://image.tmdb.org/t/p/w500/l2pIGwCvpZEpBuMb55YBl6A04Jv.jpg','1992-09-09',6.9,0),(24132,'Women on the Verge of a Nervous Breakdown','es','Pepa resolves to kill herself with a batch of sleeping-pill-laced gazpacho after her lover leaves her. Fortunately, she is interrupted by a deliciously chaotic series of events.','https://image.tmdb.org/t/p/w500/97ZxlVHtMNQcoTFaxlcz09A3dcP.jpg','1988-03-25',7.4,0),(24133,'The Marco Effect','da','When 14-year-old Marco, a homeless Romani boy, is arrested at the Danish border for possession of a missing public servant\'s passport, police inspector Carl Mørck and his Department Q team are