db.org/t/p/w500/zqeHMxO2UZmrRiRJLLxyGog3PdC.jpg','2014-06-19',4.9,0),(24138,'Bratz','en','The popular Bratz dolls come to life in their first live-action feature film. Finding themselves being pulled further and further apart, the fashionable four band together to fight peer pressure, learn what it means to stand up for your friends, be true to oneself and live out your dreams.','https://image.tmdb.org/t/p/w500/nkhA8Crs7K0JHIZgSdvBeBe2QF2.jpg','2007-08-03',5.8,0),(24139,'Mr. Right','en','A girl falls for the \"perfect\" guy, who happens to have a very fatal flaw: he\'s a hitman on the run from the crime cartels who employ him.','https://image.tmdb.org/t/p/w500/yuive5iOJF72ANOetEypK5SpfRv.jpg','2016-02-29',6.5,0),(24140,'The Curse of Buckout Road','en','A college class project on creation and destruction of modern myth, turns terrifying when a trio of young people come to realize the urban legends surrounding the famed Buckout Road may, in fact, be REAL.','https://image.tmdb.org/t/p/w500/jS47NI9UqtO17TvW6KTjiAT5Fd.jpg','2017-11-24',6.7,0),(24141,'It\'s Only the End of the World','fr','Louis, a terminally ill writer, returns home after a long absence to tell his family that he is dying.','https://image.tmdb.org/t/p/w500/zD9TQOqZrgTjI7XfHPNjNSki7C0.jpg','2016-08-26',7.2,0),(24142,'Driven','en','Talented rookie race-car driver Jimmy Bly has started losing his focus and begins to slip in the race rankings. It\'s no wonder, with the immense pressure being shoveled on him by his overly ambitious promoter brother as well as Bly\'s romance with his arch rival\'s girlfriend Sophia. With much riding on Bly, car owner Carl Henry brings former racing star Joe Tanto on board to help Bly. To drive Bly back to the top of the rankings, Tanto must first deal with the emotional scars left over from a tragic racing accident which nearly took his life.','https://image.tmdb.org/t/p/w500/8tJ4Ya8yEyxCMihDumEyvwvUuLB.jpg','2001-04-27',5.2,0),(24143,'Phineas and Ferb: Star Wars','en','Phinea