',6.5,0),(24165,'Porn to Be Free','it','Italy, 1970. An increasing legion of harmless warriors begins a peaceful struggle for sexual freedom through pornography, shaking and shocking religious authorities and conservative political institutions. They are ironic, happy, crazy. They are dreamers, defenders of definitive communion between body and soul. But they were censored and humiliated. They were mistreated and arrested for demanding loud a new cultural renaissance.','https://image.tmdb.org/t/p/w500/epgcl0Dz1RnWBK2rBpDvTfhyarU.jpg','2016-06-24',5.5,0),(24166,'Wolf Creek 2','en','Lured by the promise of an Australian holiday, backpackers Rutger, Katarina and Paul visit the notorious Wolf Creek Crater.  Their dream Outback adventure soon becomes a horrific reality when they encounter the site\'s most infamous local, the last man any traveller to the region ever wants to meet—Mick Taylor.  As the backpackers flee, Mick pursues them on an epic white knuckled rampage across hostile wasteland.','https://image.tmdb.org/t/p/w500/uELzdTzPOpZwSFqBbwpjuKE7UW3.jpg','2013-08-30',6.3,0),(24167,'The Great Gatsby','en','Nick Carraway, a young Midwesterner now living on Long Island, finds himself fascinated by the mysterious past and lavish lifestyle of his neighbor, the nouveau riche Jay Gatsby. He is drawn into Gatsby\'s circle, becoming a witness to obsession and tragedy.','https://image.tmdb.org/t/p/w500/zCjwyhfDTFgunVVzBoEFzafpjbV.jpg','1974-03-27',6.3,0),(24168,'First Reformed','en','A pastor of a small church in upstate New York starts to spiral out of control after a soul-shaking encounter with an unstable environmental activist and his pregnant wife.','https://image.tmdb.org/t/p/w500/p2UylV0hPefEuWPFMo1r56vu2nb.jpg','2018-05-18',7,0),(24169,'The Eyes of Tammy Faye','en','From the 1960\'s to the 1980\'s, evangelist Jim Baker and his ambitious wife, Tammy Faye, rose from humble beginnings to to build an empire based on big-time evangelical Christianity--only for the couple 