n Divya.','https://image.tmdb.org/t/p/w500/12VEUEHebd9ydQs0Y4ikzb179LY.jpg','2011-08-31',5.3,0),(24202,'Ravage','en','When a nature photographer explains to the Police how she fought her way out of the Watchatoomy Valley, they dismiss her crazed and violent story as a meth-induced nightmare. But when they discover that she\'s telling the truth, it\'s too late.','https://image.tmdb.org/t/p/w500/m24I9519Y6p5ajeaMB2lbFIQgYQ.jpg','2020-08-14',5.6,0),(24203,'River Runs Red','en','When the son of a successful judge is killed by two police officers and the system sets them free, a hardened veteran detective finds some incriminating files on the officers and the judge teams up with another mourning father to take the law into his own hands.','https://image.tmdb.org/t/p/w500/8GsHFBf8uIZ5thXCGqKer9OOKkQ.jpg','2018-11-09',5.5,0),(24204,'The Catcher Was a Spy','en','Former major league baseball player Moe Berg lives a double life working for the Office of Strategic Services in World War II Europe.','https://image.tmdb.org/t/p/w500/3aBv9Oln0aoBrEbkMabHIVat6CY.jpg','2018-06-22',6.3,0),(24205,'The Con Is On','en','In an effort to avoid paying off a massive gambling debt to a notorious mobster in England, a couple flees to Los Angeles and hatch a jewel theft plot.','https://image.tmdb.org/t/p/w500/d4ZzzFOokK356jf6L6vUp3RKNvM.jpg','2018-05-04',4.1,0),(24206,'2:22','en','A man\'s life is derailed when an ominous pattern of events repeats itself in exactly the same manner every day, ending at precisely 2:22 p.m.','https://image.tmdb.org/t/p/w500/rj0h3RnKX5CB8X5UE1PfpMSV4MP.jpg','2017-06-29',6,0),(24207,'Prayers for Bobby','en','Bobby Griffith was his mother\'s favorite son, the perfect all-American boy growing up under deeply religious influences in Walnut Creek, California. Bobby was also gay. Struggling with a conflict no one knew of, much less understood, Bobby finally came out to his family.','https://image.tmdb.org/t/p/w500/1viFwXluAettogGDsTrSUUg29lZ.jpg','2009-01-24',8.1,0),(24