gency to supply a refugee camp in need. But when they find the truck is actually filled with stolen gold, the band of brothers realize they’ve been double-crossed by one of their own - and putting the situation right will be all out war.','https://image.tmdb.org/t/p/w500/qMwpsjpAHvD9ZtfW88xvwlak5Pv.jpg','2018-09-20',6.5,0),(24226,'The Poseidon Adventure','en','A cruise ship succumbs to a terrorist act and capsizes on New Year\'s eve. A rag-tag group of survivors, spearheaded by a priest and a homeland security agent, must journey through the upside down vessel and attempt an escape.','https://image.tmdb.org/t/p/w500/a8eznt2qshQS8qnZ70vdsM6UBeF.jpg','2005-11-20',5.4,0),(24227,'Beethoven\'s Big Break','en','Eddie, a struggling animal trainer and single dad suddenly finds himself the personal wrangler for a large and lovable St. Bernard whose fabulous movie \"audition\" catapults the dog to stardom. However, a trio of unscrupulous ne\'er-do-wells have plans to kidnap the famous dog and hold him for ransom.','https://image.tmdb.org/t/p/w500/n6BFaobIdGWQhYI1uiq9gmY4FBq.jpg','2008-12-26',5.2,0),(24228,'Black Christmas','en','An escaped maniac returns to his childhood home on Christmas Eve, which is now a sorority house, and begins to murder the sorority sisters one by one.','https://image.tmdb.org/t/p/w500/de7ca1V0CLkWnCySrZWgnwT2EiV.jpg','2006-12-15',5.2,0),(24229,'Now and Then','en','Waxing nostalgic about the bittersweet passage from childhood to puberty in this tender coming-of-age tale, four childhood girlfriends -- Teeny, Chrissy, Samantha and Roberta -- recall the magical summer of 1970. During their walk down memory lane, they reconcile experiences with boys, secrets, bullies and more.','https://image.tmdb.org/t/p/w500/5nkAaadxFzzYfFyN3Q5j4VZKRsA.jpg','1995-10-20',6.9,0),(24230,'Pain and Glory','es','Salvador Mallo, a filmmaker in the twilight of his career, remembers his life: his mother, his lovers, the actors he worked with. The sixties in a small village in Va