nography and aligns herself with a cocaine-addicted lawyer.','https://image.tmdb.org/t/p/w500/gl6Q7GwDnwHDNd1emmQBoyUKiwB.jpg','2012-02-14',4.5,0),(24242,'A Merry Friggin\' Christmas','en','Boyd Mitchler and his family must spend Christmas with his estranged family of misfits. Upon realizing that he left all his son\'s gifts at home, he hits the road with his dad in an attempt to make the 8-hour round trip before sunrise.','https://image.tmdb.org/t/p/w500/eR9muFXkNCknGdfTQSeDS6tdPdZ.jpg','2014-11-07',5.3,0),(24243,'Heart and Souls','en','A businessman is reunited with the four lost souls who were his guardian angels during childhood, all with a particular purpose to joining the afterlife.','https://image.tmdb.org/t/p/w500/6MwnrMeuqqoc1Fg03mfU332xbyK.jpg','1993-08-13',7,0),(24244,'The Lawnmower Man','en','A simple man is turned into a genius through the application of computer science.','https://image.tmdb.org/t/p/w500/1VLqWcel87oYVmN383FgSH0mCTY.jpg','1992-03-05',5.5,0),(24245,'Detour','en','Trapped inside his car by a mudslide, smooth talking Jackson Alder suddenly finds himself in a situation he can\'t talk his way out of. With no hope of rescue, he must defy the odds; battling Mother Nature for his survival.','https://image.tmdb.org/t/p/w500/dIwLGZ3LLL99Gfrr0zLgE0YOlQi.jpg','2013-03-29',5.6,0),(24246,'Salon Kitty','it','Kitty runs a brothel in Nazi Germany where the soldiers come to \"relax\". Recording devices have been installed in each room by a power hungry army official who plans to use the information to blackmail Hitler and gain power himself. A girl named Margherita discovers the little ploy and with Kitty\'s help plans to take on the dangerous task of exposing the conspiracy.','https://image.tmdb.org/t/p/w500/kPn4HET6WI5MSXoEsfyVmobry2U.jpg','1976-03-02',5.5,0),(24247,'Sea Fever','en','The crew of a West of Ireland trawler—marooned at sea—struggle for their lives against a growing parasite in their water supply.','https://image.tmdb.org/t/p/w500/h4cPVVNP