/4RErLw0APt8qQiee0d8VCKasWwl.jpg','2019-12-05',6.4,0),(24254,'Compulsion','en','Sadie—a young female novelist—and an enigmatic woman named Francesca, are enticed by an ex-lover to join him at his Italian villa for a weekend celebration being held to honor the release of Sadie\'s latest book. Once there, Sadie begins to fear his true intentions as she and Francesca become embroiled in a dangerous game of moral and sexual discovery.','https://image.tmdb.org/t/p/w500/8fPZ50FDA0J3EamkP3g371rewNg.jpg','2016-11-19',4.8,0),(24255,'Creepshow 2','en','EC Comics-inspired weirdness returns with three tales. In the first, a wooden statue of a Native American comes to life to exact vengeance on the murderer of his elderly owners. In the second, four teens are stranded on a raft on a lake with a blob that is hungry. And in the third, a hit and run woman is terrorized by the hitchhiker she accidentally killed... or did she?','https://image.tmdb.org/t/p/w500/rfPwZFtqGHiOvfMhN00sNyO2Umb.jpg','1987-05-01',6.3,0),(24256,'Every Breath You Take','en','A psychiatrist, whose client commits suicide, finds his family life disrupted after introducing her surviving brother to his wife and daughter.','https://image.tmdb.org/t/p/w500/nrgNXpH4x9NAkqOKhxEs3TspkHc.jpg','2021-04-02',6,0),(24257,'The Legion','en','Noreno, a half-Roman, is entrusted with the mission of crossing the snowy mountains of Armenia, swarming with Parthian patrols, to seek help for his slowly dying men.','https://image.tmdb.org/t/p/w500/1kiCqFizPPpULUR1YhAkp8bO9Jo.jpg','2020-05-08',6.1,0),(24258,'Monolith','en','A mother and her son plan a surprise visit to Los Angeles to see her husband/his father. Halfway there they get into a terrible accident in the middle of nowhere and now must fight to survive.','https://image.tmdb.org/t/p/w500/9zwQXSTUNPyxUYqh87PvcKIAz67.jpg','2016-05-12',5.3,0),(24259,'Lone Wolf McQuade','en','The archetypical renegade Texas Ranger wages war against a drug kingpin with automatic weapons, his wits and martial arts after a gun battle leaves his partner dead. All of this inevitably culminates in a martial arts showdown between the drug lord and the ranger, and involving the woman they both love.','https://image.tmdb.org/t/p/w500/dTUTDPilI2Ozi5GeoBRczidQTaZ.jpg','1983-04-15',6.5,0),(24260,'The Alamo','en','The legendary true story of a small band of soldiers who sacrificed their lives in hopeless combat against a massive army in order to prevent a tyrant from smashing the new Republic of Texas.','https://image.tmdb.org/t/p/w500/54KNQfJnYZwhI3sPYyjXtptWGfg.jpg','1960-10-23',7.2,0),(24261,'Dancing Queens','sv','The story of Dylan Pettersson, a 23-year-old girl from a small island in the Swedish archipelago with big dancing aspirations.','https://image.tmdb.org/t/p/w500/xq2pkQZV5Yt1METvy5S0QjmCpsn.jpg','2021-06-03',6,0),(24262,'Serial (Bad) Weddings 2','fr','Claude and Marie Verneuil face a new crisis. The four spouses of their daughters, David, Rachid, Chao and Charles decided to leave France for various reasons. Here they are imagining their lives elsewhere.','https://image.tmdb.org/t/p/w500/kbLoWIpeZ7FthyP6diSdsDGpzr8.jpg','2019-01-30',5.9,0),(24263,'The Keeper','de','The story of a man whose love for football, for England and for the love of his life, Margaret, saw him rise from Nazi \'villain\' to British hero. Bert Trautmann, the German goalkeeper won over even his harshest opponents by winning the FA Cup Final for Manchester City in 1956 - playing on with a broken neck to secure victory.','https://image.tmdb.org/t/p/w500/nNPsc5USXEr90FoFaXXljaC1O3r.jpg','2019-03-14',7.6,0),(24264,'Dragon Ball: The Magic Begins','zh','This is a live-action version of the popular Japanese animated series Dragon Ball.','https://image.tmdb.org/t/p/w500/i7fQx8ZNRYhUjCDWBA5ujQw3qun.jpg','1991-11-30',4.1,0),(24265,'Air Bud: Golden Receiver','en','Josh and Buddy move from basketball to football in this first of several sequels to the original Air Bud.','https://image.tmdb.org/t/p/w500/y3ohh9NyWx2oj2op1dfrkwJMeFE.jpg','1998-08-14',5,0),(24266,'Tomorrow, When the War Began','en','Ellie Linton, a teen from an Australian coastal town, leads her friends on an excursion to a camp deep in the woods, dubbed \"Hell.\" Upon their return, the youths find that their town has been overrun by an enemy army, and their friends and family have been imprisoned. When the hostile invaders become alerted to their presence, Ellie and her friends band together to escape -- and strike back against -- this mysterious enemy.','https://image.tmdb.org/t/p/w500/pGElUTRxtKWlMciQYFO8dIRDytU.jpg','2010-08-08',6.2,0),(24267,'Hard Rain','en','An armored car driver tries to elude a gang of thieves while a flood ravages the countryside.','https://image.tmdb.org/t/p/w500/hhG5ppaEQIV83GbUVfPlBMDFvVu.jpg','1998-01-16',5.8,0),(24268,'Detention 101','en','Four adults are detained in their apartments with only each other and a computer for online company. They each come from a different class with differing views but they all have one defining purpose to understand why they are really being held hostage in their own homes. The AI refuses to reveal the reason.','https://image.tmdb.org/t/p/w500/eVewqvgYxo4m96ll1WEkjJcfP2e.jpg','2023-02-14',0,0),(24269,'Padmaavat','hi','Rajputana, India, 13th century. The tyrannical usurper Alauddin Khilji, sultan of Delhi, becomes obsessed with Queen Padmavati, wife of King Ratan Singh of Mewar, and goes to great lengths to satisfy his greed for her.','https://image.tmdb.org/t/p/w500/vz4GoMXj5ntc6RSrTPVj7SmGf1e.jpg','2018-01-25',6.9,0),(24270,'Tom and Jerry: The Lost Dragon','en','Tom and Jerry find a dragon egg, and help the baby dragon find its mother.','https://image.tmdb.org/t/p/w500/s2Tegfa5IOUkFx988FgTFZth189.jpg','2014-07-27',5.7,0),(24271,'Slaughtered Vomit Dolls','en','The gruesome tapestry of psychological manifestations of a nineteen year old bulimic runaway stripper-turned prostitute as she descends into a hellish pit of satanic nightmares and hallucinations.','https://image.tmdb.org/t/p/w500/6aThc82WK9Ss8VR7amjIvHV4oQH.jpg','2006-01-01',4.5,0),(24272,'Ginger Snaps 2: Unleashed','en','Brigitte has escaped the confines of Bailey Downs but she\'s not alone. Another werewolf is tailing her closely and her sister\'s specter haunts her. An overdose of Monkshood - the poison that is keeping her transformation at bay - leads to her being incarcerated in a rehabilitation clinic for drug addicts where her only friend is an eccentric young girl by the name of Ghost.','https://image.tmdb.org/t/p/w500/nTtyzQ1qFDJXLWvXX4wvOu0nYun.jpg','2004-01-30',6.5,0),(24273,'Death Race 2000','en','In a boorish future, the government sponsors a popular, but bloody, cross-country race in which points are scored by mowing down pedestrians. Five teams, each comprised of a male and female, compete using cars equipped with deadly weapons. Frankenstein, the mysterious returning champion, has become America\'s hero, but this time he has a passenger from the underground resistance.','https://image.tmdb.org/t/p/w500/zfk6wdv430Jj606dI4moiuOZ3wx.jpg','1975-04-30',6.1,0),(24274,'Penguin Bloom','en','When an unlikely ally enters the Bloom family\'s world in the form of an injured baby magpie they name Penguin, the bird’s arrival makes a profound difference in the struggling family’s life.','https://image.tmdb.org/t/p/w500/iUn7594Rwfstu5njA8hf9WQIcFi.jpg','2021-01-21',7.1,0),(24275,'Cook Up a Storm','cn','An international culinary competition becomes a battleground between rival cooks, one famous for his Cantonese street food and the other a Michelin-starred chef trained in France. But their rivalry takes an unexpected turn when they discover a common foe and combine their skills in a fusion of East and West.','https://image.tmdb.org/t/p/w500/jHMVa4VWLxggvbDo2Ol1ln4obJs.jpg','2017-02-10',7.5,0),(24276,'Bait','en','A freak tsunami traps shoppers at a coastal Australian supermarket inside the building ... along with a 12-foot great white shark.',