hUovjDzxhVfWIifnnnV.jpg','1999-11-12',6.7,0),(24283,'Half Light','en','Rachel Carson, a best-selling crime novelist, is devastated and filled with guilt over the accidental death of her son. Hoping that a change of scenery will help alleviate her suffering, she leaves her home in the city and moves into a vacant country house owned by a friend and begins a relationship with charming local Angus. But, just as her life is taking a turn for the better, Rachel realizes she\'s being romanced by a ghost, leading her to doubt her own sanity.','https://image.tmdb.org/t/p/w500/awyAxbPqKuOmQmuXSB214KObsPR.jpg','2006-01-17',6,0),(24284,'Seabiscuit','en','True story of the undersized Depression-era racehorse whose victories lifted not only the spirits of the team behind it but also those of their nation.','https://image.tmdb.org/t/p/w500/5m7NfZvxYsSm2YBCJ2VPQf8ziKr.jpg','2003-07-22',7,0),(24285,'Four Christmases','en','Brad and Kate have made something of an art form out of avoiding their families during the holidays, but this year their foolproof plan is about go bust -- big time. Stuck at the city airport after all departing flights are canceled, the couple is embarrassed to see their ruse exposed to the world by an overzealous television reporter. Now, Brad and Kate are left with precious little choice other than to swallow their pride and suffer the rounds.','https://image.tmdb.org/t/p/w500/zixj44TC7rwzpxtJAG5OzFJnEqe.jpg','2008-11-26',5.8,0),(24286,'Anatomy of a Murder','en','Semi-retired Michigan lawyer Paul Biegler takes the case of Army Lt. Manion, who murdered a local innkeeper after his wife claimed that he raped her. Over the course of an extensive trial, Biegler parries with District Attorney Lodwick and out-of-town prosecutor Claude Dancer to set his client free, but his case rests on the victim\'s mysterious business partner, who\'s hiding a dark secret.','https://image.tmdb.org/t/p/w500/zMxLbSPpToTCc6yK2Gddhx6nHNN.jpg','1959-07-01',7.9,0),(24287,'The Lost Viking','en','A young Viking called Vitharr arrives in Britain with dreams of conquest and adventure, but when his family and clan are ambushed and killed, he must survive alone in this strange,dangerous new land as he searches for his Uncle\'s settlement.','https://image.tmdb.org/t/p/w500/9gFHSGKV5EZxJe6d6qsROpAiBgQ.jpg','2018-05-28',6.4,0),(24288,'Zapped','en','Zoey is a talented dancer whose organized life is rudely disrupted when she moves in with her new step-dad and three step-brothers, until she discovers a dog-training app that can get boys to obey her every command. But she soon learns that it isn\'t the cure-all she had hoped for.','https://image.tmdb.org/t/p/w500/u33QFfbvChD5LNcuZD0LsSVnoa1.jpg','2014-06-27',6.1,0),(24289,'Madres','en','A Mexican-American couple expecting their first child relocate to a migrant farming community in 1970\'s California. When the wife begins to experience strange symptoms and terrifying visions, she tries to determine if it\'s related to a legendary curse or something more nefarious.','https://image.tmdb.org/t/p/w500/19pHi0qrUKvnUtwx6EoVbFNxg1E.jpg','2021-10-08',6,0),(24290,'Above the Rim','en','Story of a promising high school basketball star and his relationships with two brothers, one a drug dealer and the other a former basketball star fallen on hard times and now employed as a security guard.','https://image.tmdb.org/t/p/w500/q7CCx8aj8uME1fBa4KzTMdeWxXu.jpg','1994-03-23',6.9,0),(24291,'Life of the Party','en','When her husband suddenly dumps her, longtime dedicated housewife Deanna turns regret into re-set by going back to college... landing in the same class and school as her daughter, who\'s not entirely sold on the idea. Plunging headlong into the campus experience, the increasingly outspoken Deanna – now Dee Rock – embraces freedom, fun and frat boys on her own terms, finding her true self in a senior year no one ever expected.','https://image.tmdb.org/t/p/w500/749iUAWQWeutQuTd9excjmigecw.jpg','2018-05-10',6.2,0),(24292,'Asterix and the Big Fight','fr','Gaullish custom requires that a would-be chief must challenge and defeat another to become the leader of two tribes. Vitalstatistix is not perturbed because of Getafix\'s magic potion. Getafix, however has an accident and forgets how to make it. Then Vitalstatistix is suddenly challenged.','https://image.tmdb.org/t/p/w500/rcFi9JvJMjwxp4lK66v4KueqglW.jpg','1989-10-04',6.3,0),(24293,'No Escape Room','en','A father and daughter check out a small town escape room and discover there is something sinister about the place.','https://image.tmdb.org/t/p/w500/yP0mfM0MafLVMD36kgbvZpr9gbz.jpg','2018-10-06',6.3,0),(24294,'Mute','en','A mute man with a violent past is forced to take on the teeming underworld of a near-future Berlin as he searches for his missing girlfriend.','https://image.tmdb.org/t/p/w500/ihGg1xndLl3MW34Km332pNkyLH7.jpg','2018-02-23',5.6,0),(24295,'Venom','en','A group of teenagers fear for their lives in the swamps of Louisiana, chased by Mr. Jangles, a man possessed by 13 evil souls, and now relentless in his pursuit of new victims.','https://image.tmdb.org/t/p/w500/hCMTpv1I9KK90ApxXDyaf8SwJcf.jpg','2005-09-16',5.5,0),(24296,'Quarantine 2: Terminal','en','A plane is taken over by a mysterious virus. When the plane lands it is placed under quarantine. Now a group of survivors must band together to survive the quarantine.','https://image.tmdb.org/t/p/w500/ouQOquRqqaO8sPAziD4BFoNO1Pb.jpg','2011-06-16',5.7,0),(24297,'The Miseducation of Cameron Post','en','Pennsylvania, 1993. After getting caught with another girl, teenager Cameron Post is sent to a conversion therapy center run by the strict Dr. Lydia Marsh and her brother, Reverend Rick, whose treatment consists in repenting for feeling “same sex attraction.” Cameron befriends fellow sinners Jane and Adam, thus creating a new family to deal with the surrounding intolerance.','https://image.tmdb.org/t/p/w500/xFLJDW3na8AADFzQJT6bM1VU5zs.jpg','2018-07-18',6.9,0),(24298,'Like Water for Chocolate','es','Tita is passionately in love with Pedro, but her controlling mother forbids her from marrying him. When Pedro marries her sister, Tita throws herself into her cooking and discovers she can transfer her emotions through the food she prepares, infecting all who eat it with her intense heartbreak.','https://image.tmdb.org/t/p/w500/itwUdMqLmPfhtGJ44hiDxkqZhiq.jpg','1992-04-16',7.3,0),(24299,'Finders Keepers','en','A haunted doll teaches one little girl why children shouldn\'t play with undead things.','https://image.tmdb.org/t/p/w500/5817pI8hFBXqChubTM3XlHmVzpf.jpg','2014-10-18',4.7,0),(24300,'Kung Fu Dunk','zh','Shi-Jie is a brilliant martial artist from the Kung Fu School. One day, he encounters a group of youths playing basketball and shows off how easy it is for him, with his martial arts training, to do a Slam Dunk. Watching him was Chen-Li, a shrewd businessman, who recruits him to play varsity basketball at the local university.','https://image.tmdb.org/t/p/w500/cNxnBgszvHzx2QrqCORhhzl6JcM.jpg','2008-02-07',5.8,0),(24301,'My Stepmother Is an Alien','en','Trying to rescue her home planet from destruction, a gorgeous extraterrestrial named Celeste arrives on Earth and begins her scientific research. She woos quirky scientist Dr. Steve Mills, a widower with a young daughter. Before long, Celeste finds herself in love with Steve and her new life on Earth, where she experiences true intimacy for the first time. But when she loses sight of her mission, she begins to question where she belongs.','https://image.tmdb.org/t/p/w500/o9feh3DGHvNZ835cm2ajYHwZwiN.jpg','1988-12-09',5.7,0),(24302,'Flags of Our Fathers','en','There were five Marines and one Navy Corpsman photographed raising the U.S. flag on Mt. Suribachi by Joe Rosenthal on February 23, 1945. This is the story of three of the six surviving servicemen - John \'Doc\' Bradley, Pvt. Rene Gagnon and Pvt. Ira Hayes - who fought in the battle to take Iwo Jima from the Japanese.','https://image.tmdb.org/t/p/w500/bJ4h4TY6IOPpgZh9wtbPOgYrh4.jpg','2006-10-18',6.8,0),(24303,'Anastasia: Once Upon a Time','en','Anastasia Romanov escapes through a portal when her family is threatened by Vladimir Lenin, and she finds herself in the year 1988, befriended by a young American girl.','https://image.tmdb.org/t/p/w500/1g9R5lpmJ77kRcx4agxc3oIzN1C.jpg','2020-02-27',6.1,0),(24304,'The Sandlot 2','en','A decade has passed in the small town where the original Sandlot gang banded together during the summer of ’62 to play baseball and battle the Beast. Now comes the sequel, a campy romp back to the dugout where nine new kids descend on the diamond only to discover that a descendant of the Beast lives in Mr. Mertle’s backyard--a monster of mythical proportions known as \"The Great Fear.\"','https://image.tmdb.org/t/p/w500/sLsCc3X4knoYW5h05QcyygIlYIV.jpg','2005-05-03',5.9,0),(24305,'The Snow Queen','ru','The ice-cold Snow Queen wishes to turn the world into a frozen landscape, with no light, no joy, no happiness, and no free will. A young man, Kai, is rumored to be the son of a man who is the queen\'s only remaining threat. He is abducted and held captive in the queen\'s palace, and it\'s up to his sister, Gerda, to rescue him. Gerda journeys across an icy land, facing difficult obstacles and meeting wonderful new friends that help her in her quest to set Kai free, defeat the Snow Queen, and save the world from eternal frost.','https://image.tmdb.org/t/p/w500/siQpJAT2IQjN218hxJXvrHePtNS.jpg','2012-10-11',5.7,0),(24306,'A Christmas Carol','en','Scrooge is a miserly old businessman in 1840s London. One Christmas Eve he is visited by the ghost of Marley, his dead business partner. Marley foretells that Scrooge will be visited by three spirits, each of whom will attempt to show Scrooge the error of his ways. Will Scrooge reform his ways in time to celebrate Christmas?','https://image.tmdb.org/t/p/w500/oi1NcVDXlFEsdpLp37BJmFbVlg9.jpg','1999-12-05',6.8,0),(24307,'The Skin of the Wolf','es','Martinón is the last inhabitant of Auzal, a village in the mountains where he lives in communion with nature. He only goes down to the valleys twice a year to trade and to buy provisions. But one day he’s convinced to take a wife, a decision intended to soften his calloused soul—but in some ways his real struggle is only just beginning.','https://image.tmdb.org/t/p/w500/iPwqpdpyYz2LGw5oU1DczGrNi2.jpg','2018-03-09',5.2,0),(24308,'The Return of the Pink Panther','en','The famous Pink Panther jewel has once again been stolen and Inspector Clouseau is called in to catch the thief. The Inspector is convinced that \'The Phantom\' has returned and utilises all of his resources – himself and his Asian manservant – to reveal the identity of \'The Phantom\'.','https://image.tmdb.org/t/p/w500/uQMIicFrH3r3jePOoYHwts4oaC3.jpg','1975-05-21',6.8,0),(24309,'Rip Tide','en','There comes a point in everyone’s life when you have to make a decision about the direction you’re going to take. For newly-18 American fashion model Cora, that time is now. She’s moved to an Australian coastal town to be with her favourite aunt, after a \'fashion faux pas’ back home.','https://image.tmdb.org/t/p/w500/zQZJPhjLGxQWdxDlrtgagUa4Fak.jpg','2017-10-03',6.1,0),(24310,'Emma','en','Emma Woodhouse is a congenial young lady who delights in meddling in other people’s affairs. She is perpetually trying to unite men and women who are utterly wrong for each other. Despite her interest in romance, Emma is clueless about her own feelings, and her relationship with gentle Mr. Knightly.','https://image.tmdb.org/t/p/w500/k1RXXkdEs8hDEgeLXPgCUebzs8n.jpg','1996-08-02',6.7,0),(24311,'The Boy Behind The Door','en','Bobby tries to save himself and his best friend when they are kidnapped on their way home from school.','https://image.tmdb.org/t/p/w500/6e53nMgW5pXBMCc6AMvnXLWspFJ.jpg','2020-09-27',6.5,0),(24312,'Nurse 3-D','en','Abby Russell, a beautiful, dedicated nurse with a sinister side, has a secret life in which she targets and punishes dishonest men.','https://image.tmdb.org/t/p/w500/3FSl2sSRsNuOVOJgX6HsmnM3gAo.jpg','2013-09-28',5.3,0),(24313,'Leave No Trace','en','A father and daughter live a perfect but mysterious existence in Forest Park, a beautiful nature reserve near Portland, Oregon, rarely making contact with the world. But when a small mistake tips them off to authorities, they are sent on an increasingly erratic journey in search of a place to call their own.','https://image.tmdb.org/t/p/w500/w69iId8e80xBpyF0r2rfZoqRwQj.jpg','2018-06-29',6.8,0),(24314,'Michael Clayton','en','A law firm brings in its \"fixer\" to remedy the situation after a lawyer has a breakdown while representing a chemical company that he knows is guilty in a multi-billion dollar class action suit.','https://image.tmdb.org/t/p/w500/hhkW4yVIGo8Bee3UITKvqOvhNMG.jpg','2007-10-12',6.8,0),(24315,'Inside Llewyn Davis','en','In Greenwich Village in the early 1960s, gifted but volatile folk musician Llewyn Davis struggles with money, relationships, and his uncertain future.','https://image.tmdb.org/t/p/w500/cjiE3mMvDSYqVBh1iTmPs3RNY3x.jpg','2013-10-13',7.2,0),(24316,'Three Fugitives','en','On his first day after being released from jail for 14 armed bank robberies, Lucas finds himself caught up in someone else\'s robbery. Perry has decided to hold up the local bank to raise money so that he can keep his daughter, Meg, and get her the treatment she needs. Dugan, a detective, assumes Lucas helped plan the robbery, and hence Lucas, Perry and Meg become three fugitives.','https://image.tmdb.org/t/p/w500/d6Gy5Hg88lKJUumBwY0FZzwU5oD.jpg','1989-01-27',6.7,0),(24317,'Open Water','en','Two divers are left out at sea without a boat. There’s nothing but water for miles, unless they look at what’s underneath them...','https://image.tmdb.org/t/p/w500/xOjcaWBNG2PvylJOhlkaqaAAKUr.jpg','2003-10-26',5.5,0),(24318,'A Taste of Hunger','da','Maggie and Carsten love each other, they have two wonderful children and run their own gourmet restaurant; Malus. They want it all. And they have it all. Almost. They are missing the coveted Michelin Star. It has been their dream, on which they gambled everything to win. One day Carsten receives a letter saying that his wife loves somebody else. But who sent the letter and why? In their continuous passion and pursuit for the ultimate recognition, they forget that the meals of life are best enjoyed together.','https://image.tmdb.org/t/p/w500/aMy7XXgivypcXjPUeLiYOdVxX8f.jpg','2021-06-24',6.3,0),(24319,'A Perfect Ending','en','This intimate drama follows Rebecca, a woman who has kept her sexuality a secret from her friends but chooses to reveal it to a stranger. While Rebecca\'s revelations may not yield the results she expects, a perfect ending is still in reach.','https://image.tmdb.org/t/p/w500/3gjNfor0AZMdvmSJDqDoNOhyM5F.jpg','2012-06-01',6.3,0),(24320,'Dersu Uzala','ru','A military explorer meets and befriends a Goldi man in Russia’s unmapped forests. A deep and abiding bond evolves between the two men, one civilized in the usual sense, the other at home in the glacial Siberian woods.','https://image.tmdb.org/t/p/w500/i6Z4A77eO22hD0rOUu7NlCMdZBr.jpg','1975-08-02',8.1,0),(24321,'A Star Is Born','en','Drunken, has-been rock star John Norman Howard falls in love with unknown singer, Esther Hoffman, after seeing her perform at a club. He lets her sing a few songs at one of his shows and she becomes the talk of the music industry. Esther\'s star begins to rise, while John\'s continues to fall. She tries desperately to get John to sober up and focus on his music, but it may be too late to save him.','https://image.tmdb.org/t/p/w500/oVpUzCimMZ0ecni7lDuYPuRdxoQ.jpg','1976-12-17',6,0),(24322,'We Are Marshall','en','When a plane crash claims the lives of members of the Marshall University football team and some of its fans, the team\'s new coach and his surviving players try to keep the football program alive.','https://image.tmdb.org/t/p/w500/5PSiExbg6Fm8MiPJOikBCOcZFnd.jpg','2006-12-12',6.9,0),(24323,'The Adventures of Buckaroo Banzai Across the 8th Dimension','en','Adventurer/surgeon/rock musician Buckaroo Banzai and his band of men, the Hong Kong Cavaliers, take on evil alien invaders from the 8th dimension.','https://image.tmdb.org/t/p/w500/a7K5OcylQbWtCbrUzegfi31yaSs.jpg','1984-08-15',6,0),(24324,'Mom\'s Got a Date with a Vampire','en','The Hansen kids are in a jam. Adam and his best friend Duffy have gotten their hands on some tickets for the Headless Horseman concert, and his sister Chelsea has a date with her dreamy boyfriend Peter. The only problem is they\'re both grounded. Chelsea and Adam will do whatever it takes to get their mom Lynette out of the house, even if it includes a chance meeting with a very mysterious man. Everything seems to go according to plan until their little brother Taylor realizes that this stranger might be a vampire.','https://image.tmdb.org/t/p/w500/8NU0H5YlQ4zM6deW8lvlln8D2Zw.jpg','2000-10-13',5.7,0),(24325,'Devilish Education','pl','Gosia is a beautiful and innocent young maid on the catholic countryside tending the cattle. One summer day she is having a bath in the river naked as god created her. On the next day a stranger appears painting and painting all day long. As they talk the black dressed suddenly shows her a picture showing her naked in the river. At first she is very ashamed, but then she begins to forget her shyness.','https://image.tmdb.org/t/p/w500/bzfxkARdavCD4wnoMTgublrlvtW.jpg','1995-01-11',6.3,0),(24326,'Once Upon a Time in China III','cn','Master Wong and his disciples enroll in the \'Dancing Lion Competition\' to stop an assassination plot and to battle an arrogant, deceitful opponent.','https://image.tmdb.org/t/p/w500/uPRiNiLrkTRW36jdVzXD8w1xw46.jpg','1993-02-11',6.5,0),(24327,'The Recruit','en','A brilliant CIA trainee must prove his worth at the Farm, the agency\'s secret training grounds, where he learns to watch his back and trust no one.','https://image.tmdb.org/t/p/w500/zd9eNagUB7FEaqffnSw3n3Nii4p.jpg','2003-01-31',6.3,0),(24328,'Ivan Tsarevich & the Grey Wolf 5','ru','Ivan and Vasilisa had not a life, but a fairy tale. Literally. And they already knew this fairy tale, and they wanted to go there-I don’t-know-when. Here is just one butterfly with its effect waved its wing and arranged a magical reboot. Now, in the entire Far Far Away Kingdom, no one even remembers Ivan\'s name, including Vasilisa herself. So, in order to get the princess again, Ivan with the Gray Wolf needs to turn the whole cartoon universe over.','https://image.tmdb.org/t/p/w500/74f8CF18qFY4o6SquY0RJMGDPkA.jpg','2022-12-29',5,0),(24329,'Playhouse','en','Reckless Jack Travis is an irreverent horror writer notorious for scaring audiences. But as he obsesses over creating a new theatre show set in a haunted Scottish castle, demonic disturbances from deep within the walls begin to prey on his troubled daughter. When the alarming supernatural forces start to close in on him too, Jack is forced to reckon with the terrifying consequences of creating such a dark and macabre play. But will he realise the danger of unearthing a historic curse and stop writing before he damns himself, his personal sanity and those he loves forever?','https://image.tmdb.org/t/p/w500/cF4tZH8VQ6Lic3bi4WKwWDJODQf.jpg','2020-11-17',5.2,0),(24330,'The Innocents','fr','Poland, 1945. Mathilde, a young French Red Cross doctor, is on a mission to help the war survivors. When a nun seeks for her help, she is brought to a convent where several pregnant sisters are hiding, unable to reconcile their faith with their pregnancy. Mathilde becomes their only hope.','https://image.tmdb.org/t/p/w500/8ZSPkyzq80jBVezRlC80kvV6QZr.jpg','2016-02-10',7,0),(24331,'The Frozen Ground','en','An Alaska State Trooper partners with a young woman who escaped the clutches of serial killer Robert Hansen to bring the murderer to justice. Based on actual events.','https://image.tmdb.org/t/p/w500/hHDj1h3lJvYd9Cervoswz9crhWg.jpg','2013-07-11',6.3,0),(24332,'Extraction','en','When a former CIA operative is kidnapped by a group of terrorists, his son learns there is no plan for his father to be saved—so he launches his own rescue operation.','https://image.tmdb.org/t/p/w500/96FQG1MyR9mJFcvPBZAdfsVqaMO.jpg','2015-12-18',4.6,0),(24333,'Cape Fear','en','Sam Bowden witnesses a rape committed by Max Cady and testifies against him. When released after 8 years in prison, Cady begins stalking Bowden and his family but is always clever enough not to violate the law.','https://image.tmdb.org/t/p/w500/9BzUTJMoH1mQUiqI1C9glrWEuxa.jpg','1962-04-12',7.4,0),(24334,'Roza','es','Héctor returns to his town in the Guatemalan highlands after a difficult migration of many years to the north. That trip has left him wounded. With a possessive mother, a young wife who despises him since her abandonment and a young son who does not know him, Héctor will try to adapt, proposing to live as before, repairing lost time, but he runs into a community that has already discarded him. His violent reaction breaks the fabric of his environment, and he discovers that since he left everything has changed, neither Héctor nor his community will be the same.','https://image.tmdb.org/t/p/w500/89obenFh12AUwO4Ay20xPrd1FAH.jpg','2022-08-03',2,0),(24335,'Circle','en','In a massive, mysterious chamber, fifty strangers awaken to find themselves trapped with no memory of how they got there.  Organized in an inward-facing circle and unable to move, they quickly learn that every two minutes, one of them must die…executed by a strange device in the center of the room.','https://image.tmdb.org/t/p/w500/hbIL53MdZFJXsgxXaSOVuApWTs8.jpg','2015-05-28',6,0),(24336,'The Hitcher','en','On a stormy night, young Jim, who transports a luxury car from Chicago to California to deliver it to its owner, feeling tired and sleepy, picks up a mysterious hitchhiker, who has appeared out of nowhere, thinking that a good conversation will help him not to fall asleep. He will have enough time to deeply regret such an unmeditated decision.','https://image.tmdb.org/t/p/w500/jj9VF7GL3rLXHfoa8oQ4ioNT8GZ.jpg','1986-01-17',7,0),(24337,'JCVD','fr','Between his tax problems and his legal battle with his wife for the custody of his daughter, these are hard times for the action movie star who finds that even Steven Seagal has pinched a role from him! This fictionalized version of Jean-Claude Van Damme returns to the country of his birth to seek the peace and tranquility he can no longer enjoy in the United States, but inadvertently gets involved in a bank robbery with hostages.','https://image.tmdb.org/t/p/w500/8fdLq1X9n770THGtGDx2e74ETvE.jpg','2008-06-04',6.6,0),(24338,'Mine 9','en','Two miles into the earth, nine Appalachian miners struggle to survive after a methane explosion leaves them with one hour of oxygen.','https://image.tmdb.org/t/p/w500/7hxM3HmO3vS8ZxPyFlXgI0tqXug.jpg','2019-04-12',6,0),(24339,'Centurion','en','Britain, A.D. 117. Quintus Dias, the sole survivor of a Pictish raid on a Roman frontier fort, marches north with General Virilus\' legendary Ninth Legion, under orders to wipe the Picts from the face of the Earth and destroy their leader, Gorlacon.','https://image.tmdb.org/t/p/w500/ePiabUJVmHSwXtW5t98bn7G2wxo.jpg','2010-02-15',6.2,0),(24340,'Polaroid','en','High school loner Bird Fitcher has no idea what dark secrets are tied to the mysterious Polaroid vintage camera she stumbles upon, but it doesn\'t take long to discover that those who have their picture taken meet a tragic end. Bird and her friends must survive one more night as they race to solve the mystery of the haunted Polaroid before it kills them all.','https://image.tmdb.org/t/p/w500/6a1iqhfM0Y31kNPOSNPIuPrsYQ6.jpg','2019-01-10',6,0),(24341,'Family Swap','fr','Husband does not understand his wife? Conflict with children? Do you want to be heard and stood in your place? Be afraid of your desires. In this family, everything changed places, including grandmother.','https://image.tmdb.org/t/p/w500/qXeJkpKnG5wl2UqnudHapIEjyaY.jpg','2021-06-30',5.9,0),(24342,'The Condemned 2','en','A former bounty hunter who finds himself on the run as part of a revamped Condemned tournament, in which convicts are forced to fight each other to the death as part of a game that\'s broadcast to the public.','https://image.tmdb.org/t/p/w500/jXySxn7QUaBhPlJ2pzT1HViQzZh.jpg','2015-11-06',5.1,0),(24343,'The Rose Seller','es','Monica is 13 years old and has already created her own world, on the street, where she fights courageously to defend what little she has: her friends, her boyfriend, who sells drugs, and her dignity and pride that makes no concessions to anyone. On Christmas night, like every night, she sells roses to make a living. But life brings her a new appointment with loneliness, poverty, drugs and death.','https://image.tmdb.org/t/p/w500/iJfuI7jolnDeXhHmC9tm2frygpy.jpg','1998-05-13',7.7,0),(24344,'The Bunker Game','en','Laura, 25, is an actress in a L.A.R.P. (Live Action Role Playing) Game, where the participants play the survivors of an atomic war who live underground in a sealed bunker. After several mysterious accidents, the game is interrupted and the players leave the bunker while the staff remain behind to investigate the disappearance of Greg, the mastermind of the game. They soon find themselves trapped inside and in peril as they begin to die in mysterious ways and the group realizes that someone or something paranormal is playing a twisted game with them which quickly plunges into a terrifying fight for survival.','https://image.tmdb.org/t/p/w500/1FGenj5LnApAsJVLbd5Ehmn16XV.jpg','2022-02-24',5.1,0),(24345,'The Lockdown Tower','fr','In the heart of a city, the inhabitants of a tower wake up one morning to find that their building is shrouded in an opaque fog, obstructing doors and windows - a strange dark matter that devours anything that tries to pass through it. Trapped, the residents try to organize themselves, but to ensure their survival they gradually succumb to their most primitive instincts, until they sink into horror...','https://image.tmdb.org/t/p/w500/AntmPfbbt8Hrlw0M7lfm6cYwJYa.jpg','2023-02-08',3.8,0),(24346,'St Trinian\'s 2: The Legend of Fritton\'s Gold','en','The girls of St. Trinians are on the hunt for buried treasure after discovering headmistress Miss Fritton is related to a famous pirate.','https://image.tmdb.org/t/p/w500/kRNowy4kk8gKHv1ek2xFueilDpc.jpg','2009-12-18',5.6,0),(24347,'Twilight Zone: The Movie','en','An anthology film presenting remakes of three episodes from the TV series \"Kick the Can\", \"It\'s a Good Life\" and \"Nightmare at 20,000 Feet\" and featuring one original story \"Time Out\".','https://image.tmdb.org/t/p/w500/sDWARc5aYTUKE8Y2FIGVgWXuI4K.jpg','1983-06-24',6.5,0),(24348,'Hellraiser: Bloodline','en','Three generations of the same family deal with the consequences of unleashing the forces of hell.','https://image.tmdb.org/t/p/w500/eXeQKyfWzcsYYbiEtWy189cTBdB.jpg','1996-03-08',5.2,0),(24349,'Barb & Star Go to Vista Del Mar','en','The story of best friends Barb and Star, who leave their small midwestern town for the first time to go on vacation in Vista Del Mar, Florida, where they soon find themselves tangled up in adventure, love, and a villain’s evil plot to kill everyone in town.','https://image.tmdb.org/t/p/w500/2OTu5V21wqSiRl4RUy3VwqB7TXb.jpg','2021-03-29',5.9,0),(24350,'Mad Money','en','Three female employees of the Federal Reserve plot to steal money that is about to be destroyed.','https://image.tmdb.org/t/p/w500/le0r7Hf7YOy3QFdOoYXRI29T1mW.jpg','2008-01-17',6.5,0),(24351,'Becky','en','A teenager\'s weekend at a lake house with her father takes a turn for the worse when a group of convicts wreaks havoc on their lives.','https://image.tmdb.org/t/p/w500/9wqKF883Kn9c0SZV4ZmkIkFhBLh.jpg','2020-07-23',6.4,0),(24352,'Warlock: The Armageddon','en','Every six hundred years, a great evil has the opportunity to escape and unleash Armageddon. A group of five stones has the power to either free the evil, or banish it for another six hundred years. An order of Druids battles with a Warlock determined to unleash his father upon the world.','https://image.tmdb.org/t/p/w500/qpRtxbnLb0qFP93db5vwDDXvWz2.jpg','1993-05-01',5.3,0),(24353,'Saul: The Journey to Damascus','es','Known as Saul the Butcher, the stoning of Stephen was said to have shattered Saul\'s faith in the Temple and its denial of Christ as the Messiah. His conversion to Christianity and baptism as Paul changed the history of the world.','https://image.tmdb.org/t/p/w500/wOSs83A1bxpyQ1IynK8FLETrwsR.jpg','2014-04-01',5.6,0),(24354,'Sleep Tight','es','César, an unhappy concierge, maintains a peculiar relationship with the very diverse inhabitants of the upper-class apartment building where he works in Barcelona.','https://image.tmdb.org/t/p/w500/i44Mr6t3reXt7z28OMCPZTllRfr.jpg','2011-10-14',7.1,0),(24355,'A Dangerous Method','en','Seduced by the challenge of an impossible case, the driven Dr. Carl Jung takes the unbalanced yet beautiful Sabina Spielrein as his patient. Jung’s weapon is the method of his master, the renowned Sigmund Freud. Both men fall under Sabina’s spell.','https://image.tmdb.org/t/p/w500/z4uZubCUBlKi2KMomeJIN2jU16k.jpg','2011-09-30',6.3,0),(24356,'As Tears Go By','cn','Mid-level gangster Wah falls in love with his beautiful cousin, but must also continue to protect his volatile partner-in-crime and friend, Fly.','https://image.tmdb.org/t/p/w500/wdeByy59KEhjhmnNw54oqDwDH0c.jpg','1988-06-09',7,0),(24357,'Pray Away','en','In the 1970s, five men struggling with being gay in their Evangelical church started a bible study to help each other leave the \"homosexual lifestyle.\" They quickly received over 25,000 letters from people asking for help and formalized as Exodus International, the largest and most controversial conversion therapy organization in the world. But leaders struggled with a secret: their own “same-sex attractions” never went away. After years as Christian superstars in the religious right, many of these men and women have come out as LGBTQ, disavowing the very movement they helped start. Focusing on the dramatic journeys of former conversion therapy leaders, current members, and a survivor, PRAY AWAY chronicles the “ex gay\" movement’s rise to power, persistent influence, and the profound harm it causes.','https://image.tmdb.org/t/p/w500/1wikrtZZZoThwnHulB7klQek4Ai.jpg','2021-06-16',7,0),(24358,'To Steal from a Thief','es','Valencia, Spain. On a rainy morning, six armed men in disguise assault a bank. But what seemed like an easy heist, quickly goes wrong with nothing unfolding as planned, and mistrust quickly builds between the two leaders of the gang.','https://image.tmdb.org/t/p/w500/elEaCDGOymaTePaM7oL41WaT0aC.jpg','2016-03-03',6.2,0),(24359,'It\'s Complicated','en','Ten years after their divorce, Jane and Jake Adler unite for their son\'s college graduation and unexpectedly end up sleeping together. But Jake is married, and Jane is embarking on a new romance with her architect. Now, she has to sort out her life—just when she thought she had it all figured out.','https://image.tmdb.org/t/p/w500/Act1ypvpDNVzWbceIktX6KmmNhh.jpg','2009-12-23',6.5,0),(24360,'Saints and Soldiers: Airborne Creed','en','On August 15, 1944 the 517th Parachute Regimental Combat Team (PRCT) jumped over the south of France. Their mission was to support and protect the Allied Troops marching to Berlin. Landing in enemy territory, they fell under immediate attack. In their effort to complete the mission and rendez-vous with their unit, three isolated paratroopers come across a group of French resistants in desperate need. They decide to help liberate some of the captive Partisans. Doing so they will risk their lives.','https://image.tmdb.org/t/p/w500/gwqR9UY0xqBZwP2qb8ZPmf9b2lq.jpg','2012-08-17',5.6,0),(24361,'We\'re Back! A Dinosaur\'s Story','en','Captain New Eyes travels back in time and feeds dinosaurs his Brain Grain cereal, which makes them intelligent and non-violent. They agree to go to the \"Middle Future\" in order to grant the wishes of children in New York City. They are to meet Dr. Bleeb of the Museum of Natural History, but get sidetracked with their new children friends and run into the Captain\'s evil brother, Professor Screweyes.','https://image.tmdb.org/t/p/w500/iyFmhYlioe3PDZjSKWtcIhu5R02.jpg','1993-11-24',6,0),(24362,'Fly Away Home','en','Amy is only 13-years-old when her mother is killed. She goes to Canada to live with her father, an eccentric inventor whom she barely knows. Amy is miserable in her new life... until she discovers a nest of goose eggs that were abandoned when a local forest is torn down. The eggs hatch and Amy becomes \"Mama Goose\". When Winter comes, Amy, and her dad must find a way to lead the birds South….','https://image.tmdb.org/t/p/w500/obcQJkZB2OsRxd5GWIcQ5Qjv4YW.jpg','1996-09-13',6.9,0),(24363,'Obsessed','en','Things couldn\'t be better for Derek Charles. He\'s just received a big promotion at work, and has a wonderful marriage with his beautiful wife, Sharon. However, into this idyllic world steps Lisa, a temporary worker at Derek\'s office. Lisa begins to stalk Derek, jeopardizing all he holds dear.','https://image.tmdb.org/t/p/w500/x98L6eO7MsvNmXFy8TNza9UdsFI.jpg','2009-04-24',5.7,0),(24364,'Problem Child 3','en','Chapter 3 of the Problem Child trilogy features pre-teened Junior in love with a classmate that won\'t even notice him, but does notice three other boys who are rivals to Junior. This means war!','https://image.tmdb.org/t/p/w500/adCNPBJPaBjp9ikJAJYGAkqz6CE.jpg','1995-05-13',4.6,0),(24365,'The Replacement Killers','en','Hired assassin John Lee is asked by Chinatown crime boss Terence Wei to murder the young son of policeman Stan Zedkov. Lee has the boy in his sights, but his conscience gets the better of him, and he spares the child\'s life. Afraid that Wei will take revenge on his family in China, Lee seeks out expert forger Meg Coburn to obtain the passport he needs to get out of the country, but a band of replacement killers is soon on his trail.','https://image.tmdb.org/t/p/w500/5JAVd0lYhkB2dsDtt84Qt6grNIn.jpg','1998-02-06',6.2,0),(24366,'King Solomon\'s Mines','en','Ever in search of adventure, explorer Allan Quatermain agrees to join the beautiful Jesse Huston on a mission to locate her archaeologist father, who has been abducted for his knowledge of the legendary mines of King Solomon. As the kidnappers, led by sinister German military officer Bockner, journey into the wilds of Africa, Allan and Jesse track the party and must contend with fierce natives and dangerous creatures, among other perils.','https://image.tmdb.org/t/p/w500/kO5o42Nln0Y3syiv46TrE22lJdM.jpg','1985-11-22',5.5,0),(24367,'Frankie and Johnny','en','When Johnny is released from prison following a forgery charge, he quickly lands a job as a short-order cook at a New York diner. Following a brief fling with waitress Cora, Frankie develops an attraction for Cora\'s friend and fellow waitress Frankie. While Frankie resists Johnny\'s charms initially, she eventually relents when her best friend, Tim, persuades her to give Johnny a chance.','https://image.tmdb.org/t/p/w500/zSOh7hriX4mQNVxhCz1yVY4aykn.jpg','1991-10-11',6.7,0),(24368,'River of No Return','en','An itinerant farmer and his young son help a heart-of-gold saloon singer search for her estranged husband.','https://image.tmdb.org/t/p/w500/jXYjgPad6IIfZfCtzLuWTnJdijo.jpg','1954-04-30',6.7,0),(24369,'Black Mirror: Bandersnatch','en','In 1984, a young programmer begins to question reality as he adapts a dark fantasy novel into a video game. A mind-bending tale with multiple endings.','https://image.tmdb.org/t/p/w500/fR0VZ0VE598zl1lrYf7IfBqEwQ2.jpg','2018-12-28',6.8,0),(24370,'The Land Before Time VIII: The Big Freeze','en','When the dinosaur families get trapped in a valley by an ice storm, one family of \"spike tail\" dinosaurs volunteers to leave since they consume more food than the others. Meanwhile, the young dinos and a new adult dinosaur named Mr. Thicknose, head out to bring back their friend Spike, who has left his friends to be with members of his own species.','https://image.tmdb.org/t/p/w500/ztofs0LZY9Q6Ni3HEwibdZoewpd.jpg','2001-12-04',6,0),(24371,'Police Academy: Mission to Moscow','en','The Russians seek help in dealing with the Mafia from the veterans of the Police Academy. They head off to Moscow, in order to find evidence against Konstantin Konali, who marketed a computer game that everyone in the world is playing.','https://image.tmdb.org/t/p/w500/3517XQ9LpoEykyYq2TuDNS45MPP.jpg','1994-06-09',4.6,0),(24372,'Sphere','en','A spacecraft is discovered on the floor of the Pacific Ocean, presumed to be at least 300 years old and of alien origin. A crack team of scientists and experts is assembled and taken to the Habitat, a state-of-the-art underwater living environment, to investigate.','https://image.tmdb.org/t/p/w500/5IMr0L4BoONvN5i9kyVd0zGww3L.jpg','1998-02-13',6.1,0),(24373,'Minamata','en','War photographer W. Eugene Smith travels back to Japan where he documents the devastating effect of mercury poisoning in coastal communities.','https://image.tmdb.org/t/p/w500/tjn9yxa5QNFsV2mFPsaWdqOOk2g.jpg','2020-03-13',6.9,0),(24374,'The System','en','When a young soldier, newly returned from war, gets caught up in a drug bust, he is recruited by the authorities to go undercover in a notoriously dangerous prison in order to figure out what is really going on.','https://image.tmdb.org/t/p/w500/5v3grtPk3QSdjDP8ggpylA3hgIy.jpg','2022-10-28',5.8,0),(24375,'Attack the Block','en','A teen gang in a South London housing estate must team up with the other residents to protect their neighbourhood from a terrifying alien invasion.','https://image.tmdb.org/t/p/w500/wzCMnA6NDruLzgWeqMcLPDrGAdF.jpg','2011-05-12',6.5,0),(24376,'XXY','es','Alex, an intersexed 15-year-old, is living as a girl, but she and her family begin to wonder whether she\'s emotionally a boy when another teenager\'s sexual advances bring the issue to a head. As Alex faces a final decision regarding her gender, she meets both hostility and compassion.','https://image.tmdb.org/t/p/w500/4sgoignnXhqjxepHBi2inLFLhSz.jpg','2007-06-14',6.8,0),(24377,'Midnight Cowboy','en','Joe Buck is a wide-eyed hustler from Texas hoping to score big with wealthy New York City women; he finds a companion in Enrico \"Ratso\" Rizzo, an ailing swindler with a bum leg and a quixotic fantasy of escaping to Florida.','https://image.tmdb.org/t/p/w500/f7YLzOxwWzeEdo7RhAlPSBTYa8.jpg','1969-05-25',7.5,0),(24378,'Top Gun : les coulisses du grand retour','fr','','https://image.tmdb.org/t/p/w500/pSs9HbhK5rvHDKlH5YcLTSrPzih.jpg','2022-05-19',6.8,0),(24379,'Camp Cool Kids','en','Encouraged by his quirky grandfather, a young boy faces his fears at summer camp.','https://image.tmdb.org/t/p/w500/zuXKqVrP7gWPuNoo0vT5bWJcpTu.jpg','2017-07-11',5.6,0),(24380,'Appointment with Death','en','Emily Boynton, the stepmother to three children, blackmails the family lawyer into destroying a second will of her late husband that would have freed the children from her dominating influence. She takes herself, the children, and her daughter-in-law on holiday to Europe and the Holy Land. At a dig, Emily is found dead and Hercule Poirot investigates.','https://image.tmdb.org/t/p/w500/eJ2upLLbQczKPfXmkuem4CJZAIy.jpg','1988-04-15',6,0),(24381,'After the Wedding','en','Seeking funds for her orphanage in India, Isabelle travels to New York to meet Theresa, a wealthy benefactor. An invitation to attend a wedding ignites a series of events in which the past collides with the present while mysteries unravel.','https://image.tmdb.org/t/p/w500/cyFbVSajl1NGwBJdW0xOyvh9t7G.jpg','2019-08-09',6.4,0),(24382,'Deep','en','In 2100, when humanity has abandoned the earth, a colony of extravagant creatures still thrives in the deepest abyss of the ocean.','https://image.tmdb.org/t/p/w500/zMZTBbBa9eevwpWoVIVHh4Gm1ij.jpg','2017-05-12',6,0),(24383,'Dracula II: Ascension','en','Father Uffizi hunts vampires. He travels the world to behead them with his bullwhip, but his ultimate goal is to find the first vampire, Dracula. Medical students, Liz Blaine and Luke are charged with autopsying the body. When they open the abdominal cavity, they find that the liver and other organs are white, suggesting to Luke that the person did not produce his own blood but got it elsewhere, i.e., a vampire.','https://image.tmdb.org/t/p/w500/xt7DZ3Ww4itOJJzVjNxAZIdAMrB.jpg','2003-06-07',5.7,0),(24384,'Tammy','en','For Tammy, a burger-joint employee, a bad day keeps getting worse. She wrecks her car, loses her job and finds that her husband has been unfaithful. It\'s time for Tammy to hit the road, but without money or transportation, her options are limited. Her only choice is a road trip with her hard-drinking grandmother, Pearl, who has a car, cash and an itch to see Niagara Falls. It\'s not the escape Tammy had in mind, but it may be what she needs.','https://image.tmdb.org/t/p/w500/efsVMziwE9BNTDX5fNmYVA5oAzJ.jpg','2014-07-02',5.3,0),(24385,'Shaft','en','Cool black private eye John Shaft is hired by a crime lord to find and retrieve his kidnapped daughter.','https://image.tmdb.org/t/p/w500/yJChPuu2V339IiDPQDHeIh1SYpA.jpg','1971-06-25',6.5,0),(24386,'Tora! Tora! Tora!','en','In the summer of 1941, the United States and Japan seem on the brink of war after constant embargos and failed diplomacy come to no end. \"Tora! Tora! Tora!\", named after the code words use by the lead Japanese pilot to indicate they had surprised the Americans, covers the days leading up to the attack on Pearl Harbor, which plunged America into the Second World War.','https://image.tmdb.org/t/p/w500/c311sN931DixuZRer0JGYCwpx9N.jpg','1970-01-26',7.1,0),(24387,'Casper: A Spirited Beginning','en','A prequel to the first animated/live-action Casper feature, Casper: A Spirited Beginning introduces the friendliest ghost you\'ll ever know and explains how Casper met and befriended the other ghouls at Applegate Manor. After being stranded, Casper meets young Chris Carson, a lonely kid who decides to teach Casper how to be a proper ghost','https://image.tmdb.org/t/p/w500/qq3K8HnVa8VEdFWUun0ngvfa19h.jpg','1997-09-09',5.4,0),(24388,'Rags','en','Rags follows the story of Charlie Prince, an orphan living with his acerbic and unloving stepfather and spoiled, simple-minded stepbrothers. Charlie\'s dream is to be a singer, and while he is vocally talented and can write music, he can\'t seem to catch a break. Kadee Worth, on the other hand, is the daughter of music mogul Reginald Worth and is an international pop phenomenon. While the world knows her as a glamorous superstar, she is secretly frustrated with singing other people\'s songs and wearing clothes other people choose for her. Kadee wants the world to hear and see her true talent. Despite every obstacle that gets thrown in their way, once Charlie and Kadee find one another, they each finally get what they have been looking for – a voice, a stage, an audience and each other.','https://image.tmdb.org/t/p/w500/5CfrXWMeGcMlisL1YRCgpFMWiER.jpg','2012-05-28',7.2,0),(24389,'Exposed','en','After witnessing a miracle, a young Latina woman experiences strange things as a police detective searches for the truth behind his partner\'s death.','https://image.tmdb.org/t/p/w500/nM26QosEfgjEegONCiNNrYMBTxD.jpg','2016-01-22',4.9,0),(24390,'Big Brother','zh','A soldier-turned-high school teacher uses unusual methods to reach to a class of poor students, while dealing with a greedy entrepreneur and his gang of fighters as well as the government.','https://image.tmdb.org/t/p/w500/z6Y6uQn2fORr7o43EggQrTsp08o.jpg','2018-08-16',7.7,0),(24391,'Black Angel','it','Trapped in an unhappy marriage, the wife of a high ranking Fascist official starts a dangerous, self-destructive relationship with a duplicitous S.S. Officer.'