hain of events of five different characters and five different storylines that all converge to tell the story of murder and deceit.','https://image.tmdb.org/t/p/w500/pR2hj9MvnLeax2efwrEvRkHadgp.jpg','2003-09-05',6.8,0),(24398,'Saving Mr. Banks','en','Author P.L. Travers looks back on her childhood while reluctantly meeting with Walt Disney, who seeks to adapt her Mary Poppins books for the big screen.','https://image.tmdb.org/t/p/w500/qfhiVU59BSPCdOZwPNs29Z8S23K.jpg','2013-11-29',7.4,0),(24399,'Dog Day Afternoon','en','Based on the true story of would-be Brooklyn bank robbers John Wojtowicz and Salvatore Naturale. Sonny and Sal attempt a bank heist which quickly turns sour and escalates into a hostage situation and stand-off with the police. As Sonny\'s motives for the robbery are slowly revealed and things become more complicated, the heist turns into a media circus.','https://image.tmdb.org/t/p/w500/mavrhr0ig2aCRR8d48yaxtD5aMQ.jpg','1975-08-01',7.8,0),(24400,'Falling Inn Love','en','When a San Francisco exec wins a New Zealand inn, she ditches city life to remodel and flip the rustic property with help from a handsome contractor.','https://image.tmdb.org/t/p/w500/4bzu5k5vwLKgwap6pHXlCY8nlh3.jpg','2019-08-29',6.5,0),(24401,'Hamilton','en','Presenting the tale of American founding father Alexander Hamilton, this filmed version of the original Broadway smash hit is the story of America then, told by America now.','https://image.tmdb.org/t/p/w500/h1B7tW0t399VDjAcWJh8m87469b.jpg','2020-07-03',8.2,0),(24402,'The Swan Princess: A Royal Wedding','en','Princess Odette and Prince Derek are going to a wedding at Princess Mei Li and her beloved Chen. But evil forces are at stake and the wedding plans are tarnished and true love has difficult conditions.','https://image.tmdb.org/t/p/w500/mJaNBADFKRiMys8DiGemrLGYd9U.jpg','2020-07-20',7.3,0),(24403,'Eleven Days, Eleven Nights','it','In eleven days time, Michael is due to wed his fiancée Helen. However, a chance meeting with Sara