us almost to the point of obsession. From the way he carries his clothes to the manner he delivers his Physics lectures, Andrew is methodical in everything he does. But his ordered existence is suddenly disrupted when one sexually adventurous student, Valerie, starts seducing him. Andrew gives in to the temptation, and soon, the two are caught in an explosive relationship that knows no bounds.','https://image.tmdb.org/t/p/w500/i4CG3CWRqjsBzo1lSiEZ8D5fv1T.jpg','1999-02-02',4.3,0),(24409,'Furry Vengeance','en','When real estate developer Dan Sanders finalizes plans to level a swath of pristine Oregon forest to make way for a soulless housing subdivision, a band of woodland creatures rises up to throw a monkey wrench into the greedy scheme. Just how much mischief from the furry critters can the businessman take before he calls it quits?','https://image.tmdb.org/t/p/w500/vR8BBTRxU2xu0FvrTTio8CvCwi3.jpg','2010-04-30',4.9,0),(24410,'Jersey Girl','en','Ollie Trinke is a young, suave music publicist who seems to have it all, with a new wife and a baby on the way. But life deals him a bum hand when he\'s suddenly faced with single fatherhood, a defunct career and having to move in with his father. To bounce back, it takes a new love and the courage instilled in him by his daughter.','https://image.tmdb.org/t/p/w500/4h71riuBr3xYdtcHjKlHGFo32nQ.jpg','2004-03-25',6.1,0),(24411,'Bo Burnham: Inside','en','Stuck in COVID-19 lockdown, US comedian and musician Bo Burnham attempts to stay sane and happy by writing, shooting and performing a one-man comedy special.','https://image.tmdb.org/t/p/w500/ku1UvTWYvhFQbSesOD6zteY7bXT.jpg','2021-07-22',8.2,0),(24412,'Magic in the Moonlight','en','Set in the 1920s French Riviera, a master magician is commissioned to try and expose a psychic as a fraud.','https://image.tmdb.org/t/p/w500/sd6oaGSwKweRmtcBKjk8tvan3u0.jpg','2014-07-25',6.5,0),(24413,'Darc','en','To bring down a global human trafficking ring, an Interpol agent recruits the help of a 