e novel \"Lady Chatterley\'s Lover\" by D. H. Lawrence.','https://image.tmdb.org/t/p/w500/qcXamFmCTlSybSvyboN6PaS1bJG.jpg','2022-01-18',0,0),(24434,'Sex Weather','en','Sleepy-eyed filmmaker Darrel wakes to find himself in bed with his crew member Sydney. As they begin to discuss the previous evening and tepid reviews of his new film, emotions give rise to a passionate and thoughtful relationship that once could have been if either had taken the chance.','https://image.tmdb.org/t/p/w500/iXBUy4bSVuGZTAq2SnwS8FF8x93.jpg','2018-10-01',6.3,0),(24435,'Blood and Black Lace','it','Isabella, a young model, is murdered by a mysterious masked figure at a fashion house in Rome. When her diary, which details the house employees many vices, disappears, the masked killer begins killing off all the models in and around the house to find it.','https://image.tmdb.org/t/p/w500/siEti5iNAbN91Q3AR2XRPfJ1E6O.jpg','1964-04-10',7.4,0),(24436,'Lease on Love','en','Poppy is a marketing specialist whose life is turned upside down when she fakes an engagement with her boss’s handsome new client Milo, to win over her strict building manager and get Milo the penthouse suite. Will Poppy be rewarded with her dream promotion or will her ambitious plan backfire and jeopardize the engagement with her real fiancé?','https://image.tmdb.org/t/p/w500/n7ZnvKyXYybyTB6xYC6vezW6UEw.jpg','2022-10-16',6.7,0),(24437,'Pink Cadillac','en','A bounty hunter helps out the wife of a bail-jumper after her child is kidnapped by neo-Nazi types.','https://image.tmdb.org/t/p/w500/7XYykCIVegcVprrBUG16D6iYQe9.jpg','1989-05-26',5.5,0),(24438,'Invader Zim: Enter the Florpus','en','ZIM discovers his almighty leaders never had any intention of coming to Earth and he loses confidence in himself for the first time in his life, which is the big break his human nemesis, Dib has been waiting for.','https://image.tmdb.org/t/p/w500/waaPtmhVFgieG021OwoEPTkbltI.jpg','2019-07-24',7.6,0),(24439,'Tulip Fever','en','An artist falls for a married young woman while he\'s commissioned to paint her portrait. The two invest in the risky tulip market in hopes to build a future together.','https://image.tmdb.org/t/p/w500/aGBRTDMuYDKCA9g7NTGwtMZBWd.jpg','2017-07-13',6.5,0),(24440,'Ghost Town','en','Bertram Pincus, a cranky, people-hating Manhattan dentist, develops the unwelcome ability to see dead people. Really annoying dead people. Even worse, they all want something from him, particularly Frank Herlihy, a smooth-talking ghost, who pesters him into a romantic scheme involving his widow Gwen. They are soon entangled in a hilarious predicament between the now and the hereafter!','https://image.tmdb.org/t/p/w500/b8VS14DwpLlugTxVWSllYU0Gjn5.jpg','2008-09-19',6.5,0),(24441,'Catarina and the others','pt','Outside, the first sun rays break the dawn.  Sixteen years old Catarina can\'t fall asleep.  Inconsequently, in the big city adults are moved by desire...  Catarina found she is HIV positive. She wants to drag everyone else along.','https://image.tmdb.org/t/p/w500/ibDLYpA3PfF5fu2X1b5WUZl5v5a.jpg','2011-03-01',4.6,0),(24442,'Paw Patrol: Ready, Race, Rescue!','en','It’s the Adventure Bay 500! The pups have built an awesome race track and are ready to be the pit crew for their race hero, The Whoosh! But when the legendary racer is unable to drive in the championship race, he calls on his biggest fan-pup Marshall to take the wheel and race in his place! Marshall has to overcome his lack of confidence and his dastardly competition, The Cheetah, to fulfill his dream of becoming the fastest race-pup ever!','https://image.tmdb.org/t/p/w500/wZy2z2K7ZWd5fNVfUTS7yasoIOW.jpg','2019-08-02',7.1,0),(24443,'The Legacy of the Bones','es','Inspector Amaia Salazar must return to the Baztan valley in order to solve a series of suicides that seem to follow a similar pattern.','https://image.tmdb.org/t/p/w500/3sXHjTQGnlLJEVGxpmOa29Rr53O.jpg','2019-12-05',6.6,0),(24444,'Paterson','en','A week in the life of Paterson, a poet bus driver