u – evil… what you need is a good thrashing, and more”. In fact already Erik frequently receives a ‘good’ thrashing at the hands of his sadistic stepfather – so he is packed off by his mother to boardingschool','https://image.tmdb.org/t/p/w500/gruXA29fquPuRHbam75kXQMaGju.jpg','2003-09-16',7.3,0),(24454,'Shocker','en','After being sent to the electric chair, a serial killer uses electricity to come back from the dead and carry out his vengeance on the football player who turned him in to the police.','https://image.tmdb.org/t/p/w500/xEDmOhNGCKlWlS3mCiqLCVzBXVA.jpg','1989-10-27',5.6,0),(24455,'American Animals','en','Lexington, Kentucky, 2004. Four young men attempt to execute one of the most audacious art heists in the history of the United States.','https://image.tmdb.org/t/p/w500/aLbdKxgxuOPvs6CTlmzoOQ4Yg3j.jpg','2018-06-01',6.8,0),(24456,'Double Indemnity','en','A rich woman and a calculating insurance agent plot to kill her unsuspecting husband after he signs a double indemnity policy. Against a backdrop of distinctly Californian settings, the partners in crime plan the perfect murder to collect the insurance, which pays double if the death is accidental.','https://image.tmdb.org/t/p/w500/kkfKLeOTo7RjS9TxHKpknlL7huS.jpg','1944-06-14',8.2,0),(24457,'See You Soon','en','A U.S. soccer star suffers a career-threatening injury in the run-up to the World Cup, and during his recovery, embarks on an epic romance with a Russian single mom.','https://image.tmdb.org/t/p/w500/nKOHCFfMsTSpLAIQKMwXotdEggs.jpg','2019-07-25',6.4,0),(24458,'A Matter of Loaf and Death','en','Wallace and Gromit open a bakery, accidentally getting tied up with a murder mystery in the process. But when Wallace falls in love, Gromit is left to solve the case by himself.','https://image.tmdb.org/t/p/w500/aCRoffkRpWRlArR7dAkxabaimLr.jpg','2008-12-03',7.3,0),(24459,'The Blob','en','A drive-in favorite, this sci-fi classic follows teenagers Steve and his best girl, Jane, as they try to protect their homet