-17',6.7,0),(24464,'Zombie Flesh Eaters','it','On the Caribbean island of Matul, white doctor David Menard is trying to stem the tide of cannibal zombies that are returning from the dead.  Arriving on the island are Anne and reporter Peter West who are looking for Anne\'s missing father.  The pair soon find themselves under attack from the zombies.','https://image.tmdb.org/t/p/w500/giJlnw8ItTJb7IL053Z47B6S1xf.jpg','1979-08-25',6.6,0),(24465,'The Age of Innocence','en','In 19th century New York high society, a young lawyer falls in love with a woman separated from her husband, while he is engaged to the woman\'s cousin.','https://image.tmdb.org/t/p/w500/5Tuyt26v7qNR8Cl3m7ZRx36rduf.jpg','1993-09-10',7,0),(24466,'Tini: The New Life of Violetta','es','A teen star ventures out to the Italian countryside for a summer and emerges a new artist.','https://image.tmdb.org/t/p/w500/iH1d41fxNGPZ53kvQ6GRUFNwp0F.jpg','2016-05-04',7.3,0),(24467,'Burn Out','fr','Tony, a promising young motorcycle racer, is forced to do perilous drug runs to save the mother of his child from a dangerous mobster.','https://image.tmdb.org/t/p/w500/3LeFOvzjZuIC7cQiXDeSIy1ym7a.jpg','2018-01-03',6.7,0),(24468,'A Single Man','en','The life of George Falconer, a British college professor, is reeling with the recent and sudden loss of his longtime partner. This traumatic event makes George challenge his own will to live as he seeks the console of his close girl friend Charley, who is struggling with her own questions about life.','https://image.tmdb.org/t/p/w500/vhoM2LmcPlzcgBIztqqsSAYwaF7.jpg','2009-10-19',7.3,0),(24469,'Honey, We Shrunk Ourselves','en','The joke\'s on absent-minded scientist Wayne Szalinski when his troublesome invention shrinks him, his brother and their wives so effectively that their children think they\'ve completely disappeared. Of course, this gives the kids free rein to do anything they want, unaware that their parents are watching every move.','https://image.tmdb.org/t/p/w500/nbU3U