d to marry the princess and inherit great power.','https://image.tmdb.org/t/p/w500/fU6kiB3p4efwC48hDdy77eC5qJK.jpg','2014-12-12',6.3,0),(24500,'Ice Princess','en','With the help of her coach, her mom, and the boy who drives the Zamboni machine, nothing can stop Casey from realizing her dream to be a champion figure skater.','https://image.tmdb.org/t/p/w500/oLWeyvu0ZJrpxDsRrzsMeaGzyZp.jpg','2005-03-17',6.4,0),(24501,'Blue Thunder','en','Los Angeles, California. Officer Murphy, a veteran Metropolitan Police helicopter pilot suffering from severe trauma due to his harsh experiences during the Vietnam War, and Lymangood, his resourceful new partner, are tasked with testing an advanced and heavily armed experimental chopper known as Blue Thunder.','https://image.tmdb.org/t/p/w500/9tdoGRA7FNCuj1zhKDNLWpab9v5.jpg','1983-02-05',6.1,0),(24502,'Identical Love','en','When a doctor volunteers abroad, she discovers that her ex-fiancé\'s cute twin is also there. Can she love him for himself and not see him as her ex?','https://image.tmdb.org/t/p/w500/bZ1xJxTZPD8ggxXSnweRJKebOdz.jpg','2021-08-24',7.1,0),(24503,'Dragon Rider','en','An unlikely trio of heroes – a dragon, a boy and a forest brownie – embark on an epic adventure to find the “Rim of Heaven” - the mythological safe haven for all dragons.','https://image.tmdb.org/t/p/w500/ucDrOXUrVnr9X3ZmXP2Q68HDIHr.jpg','2020-10-15',7.3,0),(24504,'Lake Mungo','en','After 16-year-old Alice Palmer drowns in a local dam, her family experiences a series of strange, inexplicable events centred in and around their home. Unsettled, the Palmers seek the help of psychic and parapsychologist, who discovers that Alice led a secret, double life. At Lake Mungo, Alice\'s secret past emerges.','https://image.tmdb.org/t/p/w500/g0zCELYfBfSv8TOGC13buABVN53.jpg','2009-07-30',6.2,0),(24505,'West Side Story','en','In the slums of the upper West Side of Manhattan, New York, a gang of Polish-American teenagers called the Jets compete with a rival gang of recently immigrated Puerto Ricans, the Sharks, to \"own\" the neighborhood streets. Tensions are high between the gangs but two romantics, one from each gang, fall in love leading to tragedy.','https://image.tmdb.org/t/p/w500/nzCMu6D5q60i2bVrIQ0DxlRSgCZ.jpg','1961-12-13',7.3,0),(24506,'The Twins Effect','cn','An evil Duke attempts to kill and collect the blood of a royal family of European vampires in order to become all powerful. The only surviving member of the family travels to Hong Kong, only to complicate his struggle by falling in love with a mortal girl who just happens to have a vampire hunter for a brother.','https://image.tmdb.org/t/p/w500/frwUWEGWFiIlYekPRuZFG5N250Q.jpg','2003-03-08',5.9,0),(24507,'Zero Fucks Given','fr','Cassandre, 26, is a flight attendant for a low-cost airline. Based in Lanzarote, she’s always willing to take on extra hours and carries out her duties with robotic efficiency. On the side, she just goes with the flow and floats between Tinder, parties and lazy days. When she suddenly gets dismissed, she is forced to return home.','https://image.tmdb.org/t/p/w500/wLZ5jijVpOxHuBLmsICKLXwlldu.jpg','2022-03-02',6.4,0),(24508,'Short Circuit 2','en','Robot Johnny 5 moves to the city to help his friend Ben Jahrvi with his toy manufacturing enterprise, only to be manipulated by criminals who want to use him for their own nefarious purposes.','https://image.tmdb.org/t/p/w500/gn9Wa1fgrje1uqxiBpFjGOjUT74.jpg','1988-07-06',6.1,0),(24509,'Oxygen','fr','A woman wakes in a cryogenic chamber with no recollection of how she got there, and must find a way out before running out of air.','https://image.tmdb.org/t/p/w500/u74DFoZGTcZ8cuHO8nvQkCqXEVP.jpg','2021-05-12',6.6,0),(24510,'Look Who\'s Back','de','When Adolf Hitler reawakens at the site of his former bunker in present-day Berlin, he is mistaken for a comedian and quickly becomes a media phenomenon.','https://image.tmdb.org/t/p/w500/1CxZWytSiCzZiZA5k0AiLUFtQNA.jpg','2015-10-08',6.8,0),(24511,'Peaceful Warrior','en','A chance encounter with a stranger changes the life of a college gymnast.','https://image.tmdb.org/t/p/w500/r4VQCZe3aSo7TmmsxcyLqaoMR1l.jpg','2006-03-30',7.5,0),(24512,'The Girls from China','cn','The story is about Ying, a girl from Beijing who comes to Hong Kong to find work and stay with her wealthy uncle. She is played by the stunningly beautiful Isabella Chow, whose charms easily carry this picture','https://image.tmdb.org/t/p/w500/r8uNNPfQCpfZ0p30rKTfnv30FTz.jpg','1992-10-14',0,0),(24513,'Lovestruck: The Musical','en','Harper was one of the best dancers to hit Broadway, but an injury caused her to leave the spotlight, become a choreographer, and raise her daughter Mirabella. When Mirabella decides to quit the show to get married, her mother is determined to put a stop to the wedding and show Mirabella that she cannot give up her career for love.','https://image.tmdb.org/t/p/w500/2SYu78HqqrDw0Pph44Ikr1eNJbN.jpg','2013-04-21',6.6,0),(24514,'This Little Love of Mine','en','Laura Price is a successful San Francisco lawyer on the cusp of promotion – a far cry from her childhood growing up on a tropical island with best friends Chip and Gem. When the firm’s biggest client – Chip’s grandfather – asks Laura to travel to the island and deliver a contract to make Chip his heir, she leaves behind her practice and fiancé Owen to convince her childhood friend to sign a contract that will make him a billionaire.','https://image.tmdb.org/t/p/w500/astp4qwuZlCPVzntnKivcVJTaJj.jpg','2021-04-22',6.2,0),(24515,'Street Kings','en','Tom Ludlow is a disillusioned L.A. Police Officer, rarely playing by the rules and haunted by the death of his wife. When evidence implicates him in the execution of a fellow officer, he is forced to go up against the cop culture he\'s been a part of his entire career, ultimately leading him to question the loyalties of everyone around him.','https://image.tmdb.org/t/p/w500/csXyZ1BsDBlH0PXkOFWxggEf9WF.jpg','2008-04-10',6.6,0),(24516,'Merry Christmas, Drake & Josh','en','Step brothers Drake and Josh must give a foster family the best Christmas ever or face years in jail for a Christmas party gone wrong.','https://image.tmdb.org/t/p/w500/59GoXODSKpd3yMXgM4xXlNmf7jq.jpg','2008-12-05',7.4,0),(24517,'The Visitors: Bastille Day','fr','Stuck in the corridors of time, Godefroy de Montmirail and his faithful servant Jacquouille are projected to a time of profound political and social upheavals: the French Revolution... specifically, The Terror, time of great dangers, during which the descendants of Godefroy and Jacquouille had their castle and all their property confiscated by arrogant aristocrats, fleeing and lifes hanging by a thread.','https://image.tmdb.org/t/p/w500/z2AV9HgEjTPwY2FMzyqI36Wdqb7.jpg','2016-03-23',4.1,0),(24518,'I Am a Sex Addict','en','Just moments before his third wedding, Zahedi relates with utter sincerity and astonishing candor his obsession with prostitutes. He retraces his romantic and sexual history, including his ideological commitment to open relationships, that led to two disastrous marriages and several very pissed off ex-girlfriends.','https://image.tmdb.org/t/p/w500/D9pZcSfKvUQij7x83DeIlDic1P.jpg','2005-10-14',5.7,0),(24519,'Boomerang','en','Marcus is a successful advertising executive who woos and beds women almost at will. After a company merger he finds that his new boss, the ravishing Jacqueline, is treating him in exactly the same way. Completely traumatised by this, his work goes badly downhill.','https://image.tmdb.org/t/p/w500/cc9YAZq5NXiIEJsHjW7p2FaHQkp.jpg','1992-06-30',5.7,0),(24520,'Leprechaun: Origins','en','Two young couples backpacking through Ireland discover that one of Ireland\'s most famous legends is a terrifying reality.','https://image.tmdb.org/t/p/w500/yyZ7folrZTqEJFD7wUuGf84CmPK.jpg','2014-08-22',4.6,0),(24521,'Lord of the Flies','en','Amidst a nuclear war, a plane carrying a group of schoolboys crash lands on a deserted island. With no adult survivors, the boys are forced to fend for themselves. At first they cooperate, but when they split into two separate camps -- one led by the pragmatic Ralph and the other by militaristic Jack -- their society falls into disarray, leading to a disturbing examination of human nature and a chilling conclusion.','https://image.tmdb.org/t/p/w500/bqjnbDkmKaxXVBBY6GpWkPD5gSJ.jpg','1963-08-13',6.7,0),(24522,'Stay','en','Psychiatrist Sam Foster has a new patient, Henry Letham, who claims to be suicidal. In trying to diagnose him, Sam visits Henry\'s prior therapist and also finds Henry\'s mother -- even though Henry has said that he murdered both of his parents. As reality starts to contradict fact, Sam spirals into an unstable mental state. Then he finds a clue as to how and when Henry may try to kill himself, and races to try to stop him.','https://image.tmdb.org/t/p/w500/smhLbpeaTXAY2DYp2c6f0rnsu1X.jpg','2005-09-24',6.6,0),(24523,'I Give It a Year','en','After a quick courtship, two lovers hastily decide to tie the knot. As their first year of marriage unfolds, temptation and incompatibility put their relationship in jeopardy.','https://image.tmdb.org/t/p/w500/hCSqxrM5Sw6AhDIRfxQ4BenPd9y.jpg','2013-02-08',5.5,0),(24524,'Sex, Shame & Tears','es','A comedic drama featuring two couples and two old friends in Mexico City. Tomas visits Carlos and Ana, while Miguel and Andrea are joined by Maria. The presence of guests triggers lust, rejection, infidelities, reconciliation and other consequences.','https://image.tmdb.org/t/p/w500/1j3TiCXSguHi3IGumXKpQymvUKH.jpg','1999-06-18',6.8,0),(24525,'Cell','en','When a strange signal pulsates through all cell phone networks worldwide, it starts a murderous epidemic of epic proportions when users become bloodthirsty creatures, and a group of people in New England are among the survivors to deal with the ensuing chaos after.','https://image.tmdb.org/t/p/w500/c5N6Pw3P6TqQnGcqiVkhO9u85KB.jpg','2016-07-06',4.7,0),(24526,'Children of the Living Dead','en','Starting a new life in a quiet Pennsylvania town, Matthew Michaels only thought is to turn an old farm property into a profitable car dealership. He soon discovers that beneath the gentle surface, this small town is anything but calm and peaceful.  Firstly, he learns that his new property is located on the site of a graveyard, which all the townsfolk regard as an evil place that must never be visited.  He then discovers that years earlier the town had suffered an infestation of the living dead ...zombies who prey on human flesh. One zombie, the infamous Abbot Hayes, escaped destruction.  As the construction team begin degging, they unleash the thing the townsfolk fear the most, the wrath of Abbot Hayes and the awakening of ... The Children of the Living Dead.','https://image.tmdb.org/t/p/w500/6TFP297jwagAf7Qa6CIkO2bVxrN.jpg','2001-06-11',3.4,0),(24527,'D3: The Mighty Ducks','en','The Ducks are offered scholarships at Eden Hall Academy but struggle with their new coach\'s methods and come under pressure from the board to retain their scholarships before their big game against the Varsity team.','https://image.tmdb.org/t/p/w500/wltMr1loUKSCaEV4EDgh21eCRI3.jpg','1996-10-04',6,0),(24528,'Spies Like Us','en','Two bumbling government employees think they are U.S. spies, only to discover that they are actually decoys for nuclear war.','https://image.tmdb.org/t/p/w500/s0Sx8nd9Irq0aCPbsN78s0DYVlG.jpg','1985-12-06',6.2,0),(24529,'Fanaa','hi','Zooni Ali Beg is a blind Kashmiri girl who travels without her parents for the first time with a dance troupe to Delhi to perform in a ceremony for independence day. On her journey, she meets Rehan Khan, a casanova and tour guide who flirts with her. Although her friends warn Zooni about him, she cannot resist falling in love with him and he takes her on a private tour of New Delhi. But there is more to Rehan than meets the eye and Zooni will have to make a heartbreaking decision.','https://image.tmdb.org/t/p/w500/8YCF3drTYLc7eoLFBbbexsT3iQj.jpg','2006-05-26',6.6,0),(24530,'Darlin\'','en','Found at a Catholic hospital filthy and ferocious, feral teenager Darlin’ is whisked off to a care home run by The Bishop and his obedient nuns, where she’s to be rehabilitated into a \"good girl\" as an example of the miraculous work of the church. But Darlin’ holds a secret darker than the \"sins\" she is threatened with, and she is not traveling alone. The Woman who raised her, equally fierce and feral, is ever present in the shadows of Darlin’s psyche and is determined to come for her no matter who tries to get in her way.','https://image.tmdb.org/t/p/w500/hnNjlXAQan8WdNtQMfdldAGoqMF.jpg','2019-09-11',5.4,0),(24531,'Batman','en','The Dynamic Duo faces four super-villains who plan to hold the world for ransom with the help of a secret invention that instantly dehydrates people.','https://image.tmdb.org/t/p/w500/zzoPxWHnPa0eyfkMLgwbNvdEcVF.jpg','1966-07-30',6.3,0),(24532,'App','nl','A young psychology student is drawn into the dark and fearful world of a diabolic and mysterious App that starts to terrorize her, distributing compromising photographs, videos and text messages about herself and delves deeper and deeper into her personal life, flawlessly exposing all of her deepest secrets.','https://image.tmdb.org/t/p/w500/mlJTIFUbTBCqpOuLltLC8nlqkvL.jpg','2013-04-03',5.1,0),(24533,'In the House','fr','A sixteen-year-old boy insinuates himself into the house of a fellow student from his literature class and writes about it in essays for his French teacher. Faced with this gifted and unusual pupil, the teacher rediscovers his enthusiasm for his work, but the boy’s intrusion will unleash a series of uncontrollable events.','https://image.tmdb.org/t/p/w500/6NCBSCCcyef9aNcABsVGZwuehSC.jpg','2012-09-26',7.3,0),(24534,'I Miss Sonia Henie','sh','One camera in one setting, one attic and eight young directors – the result is a unique Dadaistic collage of seven short sketches. The original task for each filmmaker was to keep each short under three minutes, to set it in one hotel room, and to include the sentence “I miss Sonja Henie.\" This experimental film was shot over a single night at the international film festival FEST in Beograd in 1971.','https://image.tmdb.org/t/p/w500/iUKcB1zh9Yezuq44VSt1cMP67I9.jpg','1971-01-20',5.4,0),(24535,'Biyak','tl','Violet reconnects with her biological mother and her half-sister, Samantha. The sisters find their common ground as both of their worlds revolve around drugs and sexual abuse.','https://image.tmdb.org/t/p/w500/seZtPp9OFX92mN9mD7u6bc3ugUx.jpg','2022-07-01',4.7,0),(24536,'A Godwink Christmas: Second Chance, First Love','en','After 15 years, Pat moves home from Hawaii with his two sons and through a series of coincidences, or Godwinks, ends up stuck in traffic next to his high school sweetheart, Margie, at Christmas.','https://image.tmdb.org/t/p/w500/kl9hSMTOUQKhN50oMjJYcJd4uUd.jpg','2020-11-22',7.3,0),(24537,'Viva Las Vegas','en','Lucky Jackson arrives in town with his car literally in tow ready for the first Las Vegas Grand Prix - once he has the money to buy an engine. He gets the cash easily enough but mislays it when the pretty swimming pool manageress takes his mind off things. It seems he will lose both race and girl, problems made more difficult by rivalry from Elmo Mancini, fellow racer and womaniser.','https://image.tmdb.org/t/p/w500/mpI1qaQJXmqfuUgrmxczvWLcHqu.jpg','1964-02-08',6.3,0),(24538,'Return to Oz','en','Dorothy, saved from a psychiatric experiment by a mysterious girl, finds herself back in the land of her dreams, and makes delightful new friends, and dangerous new enemies.','https://image.tmdb.org/t/p/w500/pBY9FawVepBnGca1TxVhoRJV6bZ.jpg','1985-06-21',6.7,0),(24539,'High Tension','fr','Best friends Marie and Alexia decide to spend a quiet weekend at Alexia\'s parents\' secluded farmhouse. But on the night of their arrival, the girls\' idyllic getaway turns into an endless night of horror.','https://image.tmdb.org/t/p/w