xas for their Mother\'s funeral, and discover that the family ranch is now in the hands of Morgan Hastings, the town\'s gunsmith.','https://image.tmdb.org/t/p/w500/n6ox5IniBxxx6ISTol5pm36WoFr.jpg','1965-06-23',7.1,0),(24547,'The Devils','en','In 17th-century France, Father Urbain Grandier seeks to protect the city of Loudun from the corrupt establishment of Cardinal Richelieu. Hysteria occurs within the city when he is accused of witchcraft by a sexually repressed nun.','https://image.tmdb.org/t/p/w500/y1k7eiOFc6fzm8XeTa1kNGx6JIs.jpg','1971-07-01',7.5,0),(24548,'The Relic','en','A homicide detective teams up with an evolutionary biologist to hunt a giant creature that is killing people in a Chicago museum.','https://image.tmdb.org/t/p/w500/3MpMbZTrXp6ccrir16nV7YTJ4vx.jpg','1997-01-10',6,0),(24549,'I Am Vengeance: Retaliation','en','A former special-forces soldier is given the opportunity to bring the man who betrayed his team on their final mission in Eastern Europe several years ago - to justice.','https://image.tmdb.org/t/p/w500/A8EzVnKAB5kbOZOQ9UQwTxvpoj4.jpg','2020-02-29',6.1,0),(24550,'The Warlords','zh','A heroic tale of three blood brothers and their struggle in the midst of war and political upheaval. It is based on \"The Assassination of Ma,\" a Qing Dynasty (1644-1911) story about the killing of general Ma Xinyi.','https://image.tmdb.org/t/p/w500/9sAWyaASakMW9f3LSXK8Br3RCED.jpg','2007-12-12',6.7,0),(24551,'The Nativity Story','en','Mary and Joseph make the hard journey to Bethlehem for a blessed event in this retelling of the Nativity story. This meticulously researched and visually lush adaptation of the biblical tale follows the pair on their arduous path to their arrival in a small village, where they find shelter in a quiet manger and Jesus is born.','https://image.tmdb.org/t/p/w500/yt1rW7bqiuEWmTJrrojUNVtStKu.jpg','2006-11-30',7,0),(24552,'My Son','en','When a man\'s only son goes missing, he travels to the town where his ex-wife lives in search of answers. To play a man whose life is clouded by mystery, McAvoy will not be given a script of dialogue.','https://image.tmdb.org/t/p/w500/jrnCkZnktMTNYOEN5uo63nKKKHN.jpg','2021-09-23',6.2,0),(24553,'Measuring the World','de','Germany in the early 19th century. \"Die Vermessung der Welt\" follows the two brilliant and eccentric scientists Alexander von Humboldt and Carl Friedrich Gauss on their life paths.','https://image.tmdb.org/t/p/w500/cEzYumB3zmDN5VobhKHVV3jK60y.jpg','2012-10-24',6.4,0),(24554,'The Drawn Together Movie: The Movie!','en','When the mystery-solving musician Foxxy Love notices she and her fellow housemates can curse without being bleeped—something they\'ve never been able to do before—she realizes their show has been canceled. Determined to get back on the air, the gang travels to Make-A-Point-Land in order to get a point (and get back on the air).','https://image.tmdb.org/t/p/w500/gVQYBtUXC8GUQZx6RxigC3Hleab.jpg','2010-03-18',6.4,0),(24555,'Main Hoon Na','hi','An army major goes undercover as a college student. His mission is both professional and personal: to protect his general\'s daughter from a radical militant, and to find his estranged half-brother.','https://image.tmdb.org/t/p/w500/iiZ8BgmAsxKUEyO6ux8z6GHiE6j.jpg','2004-04-30',6.9,0),(24556,'Absolute Power','en','A master thief coincidentally is robbing a house where a murder—in which the President of The United States is involved—occurs in front of his eyes. He is forced to run, while holding evidence that could convict the President.','https://image.tmdb.org/t/p/w500/xX9gmwtnTi0Y8WcTF7Jsg9Hdp6W.jpg','1997-02-14',6.6,0),(24557,'We','nl','During a scorching summer in a Belgian-Dutch border village, eight teenagers play games of discovery to break the listless monotony. They challenge each other and themselves and pretty soon, their sexual curiosity starts to blur the lines between right and wrong. As innocence is crushed in depraved games and sexual exploitation, the teenagers soon turn into ruthless predators.','https://image.tmdb.org/t/p/w500/gwTKiJF57VknDuNCWgoHaJamm82.jpg','2018-07-12',5.8,0),(24558,'The Wild Bunch','en','An aging group of outlaws look for one last big score as the \"traditional\" American West is disappearing around them.','https://image.tmdb.org/t/p/w500/8j9yEC3xjy1PJDSizIbaxcHaSph.jpg','1969-06-17',7.7,0),(24559,'El Siete Machos','es','Rosario, the niece of the rancher, returns to the ranch after ten years of absence. She takes in Margarito, a worker at the ranch, who is immediately smitten by her. Rosario is rescued from a runaway horse by the Seven Men, an outlaw a la Robin Hood that steals from the rich and gives to the poor. He also happens to be the twin brother of Margarito, unbeknownst to him. The confusion between Margarito and the Seven Men generates great comical situations in the film.','https://image.tmdb.org/t/p/w500/stghzuBSuhiBbvAIxrm8D0G8m1z.jpg','1951-02-05',8.1,0),(24560,'About a Boy','en','Will Freeman is a good-looking, smooth-talking bachelor whose primary goal in life is avoiding any kind of responsibility. But when he invents an imaginary son in order to meet attractive single moms, Will gets a hilarious lesson about life from a bright, but hopelessly geeky 12-year-old named Marcus. Now, as Will struggles to teach Marcus the art of being cool, Marcus teaches Will that you\'re never too old to grow up.','https://image.tmdb.org/t/p/w500/qoZ1bD0q9EFqcNiEYbEigsRcNCt.jpg','2002-04-26',6.7,0),(24561,'The Land Before Time XIV: Journey of the Brave','en','On a day known to the dinosaurs as \"Treasure Day\", Bron becomes stuck in the Mysterious Beyond. This event urges the young Longneck Littlefoot to take his friends on a quest to the Fire Mountain to save his father. Along the way, they befriend a Flyer.','https://image.tmdb.org/t/p/w500/eXffrLPK4dyDnc9IO8Qt9rNYz5p.jpg','2016-02-02',6.9,0),(24562,'Petals on the Wind','en','This sequel to Flowers in the Attic picks up 10 years after Cathy, Chris and Carrie managed to escape Foxworth Hall.','https://image.tmdb.org/t/p/w500/uY49FstxwUrf8syltAeqTHU0Pty.jpg','2014-05-26',6.5,0),(24563,'Chasing Mavericks','en','Surfer Jay Moriarity sets out to ride the Northern California break known as Mavericks.','https://image.tmdb.org/t/p/w500/7wxJmFqTMcdE05sfWedB6458US1.jpg','2012-10-25',7,0),(24564,'Spin Me Round','en','When the manager of an Italian restaurant chain wins the opportunity to attend the franchise’s educational immersion program in Italy, what she thought would be a romantic getaway devolves into chaos and catastrophe.','https://image.tmdb.org/t/p/w500/oQ3EWU329YDGi4BOrEHpopq0BZi.jpg','2022-08-19',4.5,0),(24565,'Forever Out of My League','it','Marta may be an orphan, and she may be affected by a lethal illness, yet she is the most positive person one can meet. She wants a boy to fall for her. Not any boy - the most handsome of them all. One day, she may have found her match.','https://image.tmdb.org/t/p/w500/1zhsT17wTXAw5IxK9rSLtftu7Aw.jpg','2022-01-31',5.7,0),(24566,'Another Earth','en','On the night of the discovery of a duplicate Earth in the Solar system, an ambitious young student and an accomplished composer cross paths in a tragic accident.','https://image.tmdb.org/t/p/w500/qvGJK3lFzpifAdyIupMNdWNX0qr.jpg','2011-07-22',6.7,0),(24567,'Kuch Kuch Hota Hai','hi','Per her mother\'s last wish, an 8 year old girl sets out to reunite her father with his college best friend who was in love with him.','https://image.tmdb.org/t/p/w500/5FmtHHDGPofW5Zjns1EM1D8503c.jpg','1998-10-16',7.6,0),(24568,'When a Man Loves a Woman','en','An airline pilot and his wife are forced to face the consequences of her alcoholism when her addictions threaten her life and their daughter\'s safety. While the woman enters detox, her husband must face the truth of his enabling behavior.','https://image.tmdb.org/t/p/w500/cA1uMNX3sdWAWfMZbsgm1VIJYSY.jpg','1994-04-29',6.5,0),(24569,'Inspector Gadget','en','John Brown is a bumbling but well-intentioned security 