.org/t/p/w500/xgBzMsP8a10rEHXNSytPsLhwUVF.jpg','2021-10-29',6.2,0),(24591,'Vampires vs. the Bronx','en','Three gutsy kids from a rapidly gentrifying Bronx neighborhood stumble upon a sinister plot to suck all the life from their beloved community.','https://image.tmdb.org/t/p/w500/rcdBUbbYNccz8q9LOuBEKC1avMA.jpg','2020-10-02',5.8,0),(24592,'My Babysitter\'s a Vampire','en','Geeky 14-year old Ethan is left to babysit his younger sister, Jane, with his best friend Benny but after Ethan inadvertently puts Jane in harm\'s way, his parents hire a professional babysitter, the beautiful yet mysterious 17-year-old Sarah who, unbeknownst to them, is actually a fledgling vampire.','https://image.tmdb.org/t/p/w500/dUWPPf9kCmnO5TxP08zsa6u0YmP.jpg','2010-10-09',6.9,0),(24593,'Megalodon Rising','en','When history’s greatest aquatic predator returns, the armada of modern warships sent to destroy it has no chance at all.','https://image.tmdb.org/t/p/w500/vWeWU43mNVzpAnjgzxnvi9xgo9d.jpg','2021-08-27',6.4,0),(24594,'A un paso de mí','es','Tatiana is a journalist with a routine life in all its aspects and a recently failed love relationship. Motivated by her best friend, she decides to make a stop and travel around Costa Rica to find herself and inner peace.','https://image.tmdb.org/t/p/w500/12qaWw3KntFPoOCEJFSCLAuL7rN.jpg','2021-02-25',7,0),(24595,'Pay the Ghost','en','One year after his young son disappeared during a Halloween carnival, Mike Cole is haunted by eerie images and terrifying messages he can’t explain. Together with his estranged wife, he will stop at nothing to unravel the mystery and find their son—and, in doing so, he unearths a legend that refuses to remain buried in the past.','https://image.tmdb.org/t/p/w500/iHG1QcxaRCiFIdSK1HZA6zOEFsl.jpg','2015-09-16',5.4,0),(24596,'Murmur of the Heart','fr','This loosely plotted coming-of-age tale follows the life of 15-year-old Laurent Chevalier as he stumbles his way over the burgeoning swell of adolescence in 1950s France. After having his first sexual experience with a prostitute and dodging the lips of a priest, Chevalier contracts a case of scarlet fever. When the fever leaves him with a heart murmur, Chevalier is placed in a sanatorium, along with his over-attentive and adulterous mother.','https://image.tmdb.org/t/p/w500/gJt4ojBYsaUDGnKqnIqGvQOLpjh.jpg','1971-04-27',7.1,0),(24597,'The Wing or the Thigh?','fr','Charles Duchemin, a well-known gourmet and publisher of a famous restaurant guide, is waging a war against fast food entrepreneur Tri- catel to save the French art of cooking. After having agreed to appear on a talk show to show his skills in naming food and wine by taste, he is confronted with two disasters: his son wants to become a clown rather than a restaurant tester and he, the famous Charles Duchemin, has lost his taste!','https://image.tmdb.org/t/p/w500/ywkIu5l3iAgPZvLFEVBDYxLouH8.jpg','1976-10-27',7.2,0),(24598,'Tabu','pt','Lisbon, Portugal, 2010. Pilar, a pious woman devoted to social causes, maintains a peculiar relationship with her neighbor Aurora, a temperamental old woman obsessed with gambling who lives tormented by a mysterious past.','https://image.tmdb.org/t/p/w500/y8UypeZK8Q3XvwRpv959553lsxX.jpg','2012-04-05',7,0),(24599,'The Ghost Writer','en','A writer stumbles upon a long-hidden secret when he agrees to help former British Prime Minister Adam Lang complete his memoirs on a remote island after the politician\'s assistant drowns in a mysterious accident.','https://image.tmdb.org/t/p/w500/rK7m2Ba0ieXa37NaAmrx4dfRvvM.jpg','2010-02-12',6.8,0),(24600,'Horsemen','en','A recently widowed detective still grieving over his wife\'s death discovers a shocking connection between himself and the suspects in a serial killing spree linked to the Four Horsemen of the Apocalypse.','https://image.tmdb.org/t/p/w500/sIVBGmRXsPuI1TES9sKUImMOw2Q.jpg','2009-02-06',5.9,0),(24601,'3 Ninjas','en','Each year, three brothers Samuel, Jeffrey and Michael Douglas visits their Japanese