 Bollywood movie. But when there they discover that they will have to compete against each other to get the role in the movie. Will the Cheetah\'s break up again?','https://image.tmdb.org/t/p/w500/aIxBQvA3h6WbD3LJtXspWL8GOw3.jpg','2008-08-22',6.1,0),(24621,'The Freshmen','fr','Antoine is about to start his first year of medical school… for the third time. Benjamin, just out of high school, will make his first try. He soon realizes it\'s not exactly a walk in the park. In a fiercely competitive environment, with nights dedicated to hard studying rather than hard partying, the two freshmen will have to adapt and find a middle ground between despair for the present and hope for the future.','https://image.tmdb.org/t/p/w500/mhiT79x4G0OIm82uNq1A1KTSdoi.jpg','2018-09-12',6.7,0),(24622,'A Matter of Life and Death','en','When a young RAF pilot miraculously survives bailing out of his aeroplane without a parachute, he falls in love with an American radio operator. But the officials in the other world realise their mistake and dispatch an angel to collect him.','https://image.tmdb.org/t/p/w500/H74LWKnhOeIFSk9gNjBcPjIov3.jpg','1946-12-15',7.7,0),(24623,'Mickey: The Story of a Mouse','en','Mickey Mouse is one of the most enduring symbols in our history. Those three simple circles take on meaning for virtually everyone on the planet. So ubiquitous in our lives that he can seem invisible, Mickey is something we all share, with unique memories and feelings. Over the course of his nearly century-long history, Mickey functions like a mirror, reflecting our personal and cultural values back at us. \"Mickey: The Story of a Mouse\" explores Mickey\'s significance, getting to the core of what Mickey\'s cultural impact says about each of us and about our world.','https://image.tmdb.org/t/p/w500/cYHE9FdgXBFUWvWaIKsDHODDOTS.jpg','2022-03-19',7.1,0),(24624,'Intolerable Cruelty','en','A revenge-seeking gold digger marries a womanizing Beverly Hills lawyer with the intention of making a killing in the divorce.','https://image.tmdb.org/t/p/w500/7K8hDwOWsZv0MluyrB8nWlhJOgB.jpg','2003-09-02',5.9,0),(24625,'Terms of Endearment','en','Aurora, a finicky woman, is in search of true love while her daughter faces marital issues. Together, they help each other deal with problems and find reasons to live a joyful life.','https://image.tmdb.org/t/p/w500/iZiYzBb6nyv2anbpVTV5ba6GSwq.jpg','1983-11-20',7.1,0),(24626,'Cirque du Soleil: Worlds Away','en','An original story featuring performances by Cirque du Soleil. A young woman is entranced by an Aerialist. When they fall into the dreamlike world of Cirque du Soleil and are separated, they travel through the different tent worlds trying to find each other.','https://image.tmdb.org/t/p/w500/jAt4ugebhXKmAnirHAWe5P6gnMi.jpg','2012-11-09',7,0),(24627,'Monster High: Great Scarrier Reef','en','Join your favourite ghoulfriends in an all-new aquatic adventure! When the ghouls get pulled into the school pool, they\'re transported to the gore-geous underwater world of the Great Scarrier Reef. Lagoon realizes she\'s come home and, in a fintastic mission of the heart, decides to come to terms with her own freaky flaws. Of course she\'ll need help from the most creeperific firends ever as she confronts a frenemy from her past, competes in a scaretastic dance extravaganze, and fights a terrible beast from the deep!','https://image.tmdb.org/t/p/w500/fSyx6I8PVT91d6LgNReYLRyDt0e.jpg','2016-02-12',7.8,0),(24628,'Superman vs. The Elite','en','The Man of Steel finds himself outshone by a new team of ruthless superheroes who hold his idealism in contempt.','https://image.tmdb.org/t/p/w500/6yKW9NVcqySQKa9gVe7GG3WuE9N.jpg','2012-06-12',6.9,0),(24629,'Targeted','es','Axel is an employee of a call center who is used to complaints from his clients and an unbearable boss. Axel has a natural talent for dealing with people and their problems. But one day everything changes, when he receives a call from Figueroa Mont, a frustrated client who wants to unsubscribe. Fed up with the bureaucracy of the companies, Figueroa warns Axel that he is watching him through a telescopic sight attached to a high-precision rifle and that if he does not solve the problem, he will blow his head off.','https://image.tmdb.org/t/p/w500/cEWR4xyXgag2iNVGc7tNkGq12k9.jpg','2022-04-28',5.8,0),(24630,'Once Upon a Time: The Super Heroes','fr','The historical saga of American superheroes. Born in the period between the Great Depression and the World War II to combat the hobgoblins of the modern world, these mutant human beings with superhuman powers colonized the funny papers, radio dramas, television and films, to become a truly national industry in the United States: they gave expression to the fears and obsessions of the twentieth century and bolstered American ideals.','https://image.tmdb.org/t/p/w500/b6760qS8pEb3elWp4e7KPQsGliC.jpg','2001-12-23',6.5,0),(24631,'Out of Sight','en','Meet Jack Foley, a smooth criminal who bends the law and is determined to make one last heist. Karen Sisco is a federal marshal who chooses all the right moves … and all the wrong guys. Now they\'re willing to risk it all to find out if there\'s more between them than just the law.','https://image.tmdb.org/t/p/w500/v49q7AMR3pB4M762woWB1NYMCLF.jpg','1998-06-26',6.7,0),(24632,'Fast 888','th','When his brakes fail, a bus driver embarks on a chaotic journey to keep his eccentric group of passengers safe.','https://image.tmdb.org/t/p/w500/eQix6j3ZlsUIN5lRTGNFRBIPZq.jpg','2016-10-09',6,0),(24633,'Bed Rest','en','A pregnant woman on bed rest begins to wonder if her house is haunted or if it\'s all in her head.','https://image.tmdb.org/t/p/w500/tiZF8b9T9fMcwvsEEkJ5ik1wCnV.jpg','2022-12-08',4.8,0),(24634,'Slaughterhouse Rulez','en','An illustrious British boarding school becomes a bloody battleground when a mysterious sinkhole appears at a nearby fracking site unleashing unspeakable horror.','https://image.tmdb.org/t/p/w500/wfLzocgEa7DDQAJWeorEiDFx9WM.jpg','2018-10-31',5.5,0),(24635,'A Castle for Christmas','en','To escape a scandal, a bestselling author journeys to Scotland, where she falls in love with a castle -- and faces off with the grumpy duke who owns it.','https://image.tmdb.org/t/p/w500/xhRbfdGRcEv6RUiAfWnER2pOCcU.jpg','2021-11-26',6,0),(24636,'Barely Lethal','en','A 16-year-old international assassin yearning for a \"normal\" adolescence fakes her own death and enrolls as a senior in a suburban high school. She quickly learns that being popular can be more painful than getting water-boarded.','https://image.tmdb.org/t/p/w500/8emz9dKW8KKIqG8WcFG1lJbr2ub.jpg','2015-04-30',5.8,0),(24637,'The Colony','en','Forced underground by the next ice age, a struggling outpost of survivors must fight to preserve humanity against a threat even more savage than nature.','https://image.tmdb.org/t/p/w500/zC4lm38NV09xzHJVAw4jpTfhJjB.jpg','2013-04-12',5.4,0),(24638,'Lemonade Mouth','en','After five disparate high school students meet in detention, they realize they have more in common than they think and form a band that becomes a champion for students sidelined by the high school elite.','https://image.tmdb.org/t/p/w500/nrGiOFh7wk2x726tiN8kQ6nhF5b.jpg','2011-12-06',7.5,0),(24639,'Rattlesnake','en','After a mysterious woman saves her daughter from a deadly snakebite, a single mother must repay the debt by killing a stranger before sundown.','https://image.tmdb.org/t/p/w500/cEr3S3Atr4eRlHmMOA1GvaX0f4p.jpg','2019-10-25',5.2,0),(24640,'Herbie Goes Bananas','en','The adorable little VW helps its owners break up a counterfeiting ring in Mexico.','https://image.tmdb.org/t/p/w500/bjTA6ARhXzPUZTWMg7ScwVlu4w4.jpg','1980-06-25',5.2,0),(24641,'Hot Bot','en','Hot Bot is the hilarious journey of two sexually repressed and unpopular teenage geeks who accidentally discover a life-like super-model sex bot.','https://image.tmdb.org/t/p/w500/8RDA2lNABrzve1FaeNfyrLKNhye.jpg','2016-03-01',4.3,0),(24642,'Time Freak','en','Stillman, a heartbroken physics student, builds a time machine when his girlfriend breaks up with him. Going back in time, he attempts to save their relationship by fixing every mistake he made—while dragging his best friend along in the process.','https://image.tmdb.org/t/p/w500/oSDctngY0Oiq6l2LcJDk8k6smvg.jpg','2018-11-09',6.6,0),(24643,'10 Minutes Gone','en','Crime boss Rex hires Frank and his crew to steal a priceless jewel stash — but the job goes wrong when someone tips off the cops. After Frank suffers a blow to the head, he wakes up to find the jewels gone and no memory of his attacker. Now, Frank must confront his team members one by one to find the traitor — before Rex covers his tracks by having Frank murdered.','https://image.tmdb.org/t/p/w500/i8lVYRplWdCEqYOutxpxeCtaD2a.jpg','2019-09-30',5.5,0),(24644,'Cyborg X','en','After X-Corp, a radical weapons manufacturer, is taken over by a Cyber Virus, a group of survivors must fight to save humanity from the army of Machines the Virus now controls.','https://image.tmdb.org/t/p/w500/83hXrNOZTnEEhDnHorjDBowWvxd.jpg','2016-05-17',5.8,0),(24645,'Love the Coopers','en','When four generations of the Cooper clan come together for their annual Christmas Eve celebration, a series of unexpected visitors and unlikely events turn the night upside down, leading them all toward a surprising rediscovery of family bonds and the spirit of the holiday.','https://image.tmdb.org/t/p/w500/fPW1BHZhUEViOmDAHFfyLezoQdI.jpg','2015-11-12',6,0),(24646,'Emmanuelle 4','fr','In order to escape from her former lover Marc, Sylvia goes to Brazil where Dr. Santamo transforms her into the beautiful Emmanuelle...','https://image.tmdb.org/t/p/w500/2QRAGWpl1WAVnJQgJ2BpO67x5Mj.jpg','1984-02-15',4.9,0),(24647,'Tales from the Crypt','en','Five people find themselves in a tomb. The Crypt keeper explains why they are there through a series of frightening stories. Based on the classic comic book.','https://image.tmdb.org/t/p/w500/gVY5oWR9id9ugnCAurChhssEsCP.jpg','1972-03-09',6.9,0),(24648,'Bullet Head','en','A group of career criminals finds itself trapped in a warehouse with the law – and an Attack Dog named DeNiro closing in.','https://image.tmdb.org/t/p/w500/ySmKQPjWnNzuZ5YliQaOVEnWn2.jpg','2017-12-07',4.9,0),(24649,'Raise the Red Lantern','zh','China in the 1920s. After her father\'s death, 19 year old Songlian is forced to marry the much older lord of a powerful family. With three wives already, each living in a separate house within the great castle, there is fierce competition for his attention and the privileges that are gained. This competition gets out of hand.','https://image.tmdb.org/t/p/w500/j6MGZpg55cTqlHHwahBtzI2qQg1.jpg','1991-12-18',8,0),(24650,'Dave','en','A sweet-natured Temp Agency operator and amateur Presidential look-alike is recruited by the Secret Service to become a temporary stand-in for the President of the United States.','https://image.tmdb.org/t/p/w500/wIUuf1NFchdCJe833JBTiSMzqfv.jpg','1993-05-07',6.7,0),(24651,'Highlander III: The Sorcerer','en','Starts off in the 15th century, with Connor McLeod training with another immortal swordsman, the Japanese sorcerer Nakano. When an evil immortal named Kane kills the old wizard, the resulting battle leaves him buried in an underground cave. When Kane resurfaces in the 20th century to create havoc, it\'s up to McLeod to stop him.','https://image.tmdb.org/t/p/w500/4lVKy9bsVw78EFhd4yHTDwgBr0U.jpg','1994-11-29',4.8,0),(24652,'All Star Superman','en','Lex Luthor enacts his plan to rid the world of Superman, once and for all. Succeeding with solar radiation poisoning, the Man of Steel is slowly dying. With what little times remains, the Last Son of Krypton must confront the revealing of his secret identity to Lois Lane and face Luthor in a final battle.','https://image.tmdb.org/t/p/w500/30GAgK0SvrRoopHlEcrchXqD0hf.jpg','2011-02-22',6.9,0),(24653,'Under Suspicion','en','A lawyer is asked to come to the police station to clear up a few loose ends in his witness report of a foul murder. \"This will only take ten minutes\", they say, but it turns out to be one loose end after another, and the ten minutes he is away from his speech become longer and longer.','https://image.tmdb.org/t/p/w500/rAu7CA2qLTaXZd0fHVeNI2NB5WN.jpg','2000-09-24',6.1,0),(24654,'Broken Idol: The Undoing of Diomedes Díaz','es','This documentary chronicles Diomedes Díaz\'s rise as one of Colombia\'s most iconic singers, and his downfall after being accused of killing a fan.','https://image.tmdb.org/t/p/w500/1zQXBbMbltvtEgmBELYjB0MWfU7.jpg','2022-03-30',7.3,0),(24655,'Baby on Board','en','The story of Angela, an ambitious, image-conscious businesswoman working for over-demanding boss Mary. When Angela becomes unexpectedly pregnant at the peak of her career, her life with her divorce attorney husband, Curtis, is turned upside-down.','https://image.tmdb.org/t/p/w500/5fsemnPiqmx0RMFFVytHN0nRTXY.jpg','2009-06-09',4.9,0),(24656,'Emmanuelle Through Time: Emmanuelle\'s Supernatural Sexual Activity','en','Emmanuelle and her crew face sexual spirits. Let the spirit take you on a fascinating and erotic adventure.','https://image.tmdb.org/t/p/w500/bL92XUDxGiiLIJcwtIRSJUkxmAq.jpg','2012-06-02',5.2,0),(24657,'Travis Scott: Look Mom I Can Fly','en','While crafting his Grammy-nominated album \"Astroworld,\" Travis Scott juggles controversy, fatherhood and career highs in this intimate documentary.','https://image.tmdb.org/t/p/w500/oNOXntnRY7dFrgu1x6bQQmWBVdu.jpg','2019-08-28',7,0),(24658,'Despite Everything','es','Sara, Lucía, Sofía and Claudia are sisters, 4 modern women with very different personalities, who come together at their mother\'s funeral, after which they discover the man they\'ve all called \"dad\" throughout their lives is not really their father. They embark on a quest to discover who their real fathers are, discovering more about themselves, their mother, and their lives.','https://image.tmdb.org/t/p/w500/c6JCsYCfTKeewhHQu7tgpg0KZDC.jpg','2019-03-16',6,0),(24659,'White Lie','en','Katie Arneson is faking cancer. A university dance major, Katie\'s falsified diagnosis and counterfeit fundraising have transformed her into a campus celebrity surrounded by the supportive community she\'s always dreamed of. But now dependent on a bursary for sick students to maintain her ruse, Katie learns the funding is in jeopardy unless she can provide copies of her medical records within the week.','https://image.tmdb.org/t/p/w500/m5tWkRvCgwnv0cSzgo6ZfYXpkYM.jpg','2019-09-07',6.8,0),(24660,'Fatima','en','In 1917, outside the parish of Fátima, Portugal, a 10-year-old girl and her two younger cousins witness multiple visitations of the Virgin Mary, who tells them that only prayer and suffering will bring an end to World War I.  As secularist government officials and Church leaders try to force the children to recant their story, word of the sighting spreads across the country, inspiring religious pilgrims to flock to the site in hopes of witnessing a miracle..','https://image.tmdb.org/t/p/w500/mKp5RBvc1HVC3wvTLLHJ334HHnk.jpg','2020-08-13',7.4,0),(24661,'Mass','en','Two couples meet for a painful and raw conversation in the aftermath of a violent tragedy.','https://image.tmdb.org/t/p/w500/oqaqsMTLmNaM50tQG4k8EkR6AxY.jpg','2021-10-08',7.7,0),(24662,'Garden State','en','Andrew returns to his hometown for the funeral of his mother, a journey that reconnects him with past friends. The trip coincides with his decision to stop taking his powerful antidepressants. A chance meeting with Sam - a girl also suffering from various maladies - opens up the possibility of rekindling emotional attachments, confronting his psychologist father, and perhaps beginning a new life.','https://image.tmdb.org/t/p/w500/h3iqYiGS6F3y7GxaS4AT8nFxZ2i.jpg','2004-07-28',7.1,0),(24663,'The Half of It','en','Shy, straight-A student Ellie is hired by sweet but inarticulate jock Paul, who needs help wooing the most popular girl in school. But their new and unlikely friendship gets tricky when Ellie discovers she has feelings for the same girl.','https://image.tmdb.org/t/p/w500/jC1PNXGET1ZZQyrJvdFhPfXdPP1.jpg','2020-05-01',7.1,0),(24664,'Private School','en','Private-school student Christine loves Jim. But her classmate, Jordan, is also vying for Jim\'s attention and trying to end his relationship with Christine. Meanwhile, Jim\'s friend Bubba embarks on a series of sexual escapades, including dressing up as a woman to access the girls\' locker room. Despite Jim and Christine\'s efforts to spend some time alone, various shenanigans and schemes interfere.','https://image.tmdb.org/t/p/w500/751YiDofTR5mon16NQXgyX9vxqb.jpg','1983-06-29',5.4,0),(24665,'Seberg','en','An ambitious young FBI agent is assigned to investigate iconic actress Jean Seberg when she becomes embroiled in the tumultuous civil rights movement in late 1960s Los Angeles.','https://image.tmdb.org/t/p/w500/kv78WJ2YvWyk3c32sbOGFh64xcs.jpg','2019-12-13',5.9,0),(24666,'Radio Rebel','en','High school senior Tara is so painfully shy that she dreads speaking to anyone in the hallways or getting called on in class. But in the privacy of her bedroom with her iPod in hand, she rocks out -- doing mock broadcasts for Miami\'s hottest FM radio station, which happens to be owned by her stepfather. When a slot opens up at The SLAM, Tara surprises herself by blossoming behind the mike into confident, \"Radio Rebel\" -- and to everyone\'s shock, she\'s a hit!','https://image.tmdb.org/t/p/w500/wycDdx2BrdNKlyTZoZT8uLeu6dq.jpg','2012-06-09',6.2,0),(24667,'Young Guns','en','A group of young gunmen, led by Billy the Kid, become deputies to avenge the murder of the rancher who became their benefactor. But when Billy takes their authority too far, they become the hunted.','https://image.tmdb.org/t/p/w500/stvh1A3mj8NYyczE7RvwdtDRCo2.jpg','1988-02-17',6.7,0),(24668,'Savage Dog','en','A story set in Indochina in 1959, a lawless land controlled by the criminal class: Vietnamese warlords and European war-criminals. Den-Dhin-Chan Labor Camp is run by four such dangerous men. The worst prison in the land, it is here that an Irish, former-champion boxer Martin Tillman has made a name for himself fighting tournaments, on which wealthy criminals gamble in high stakes events. When Tillman is due for release, he just wants to return home, but the corrupt forces running the jail will do everything in their power to keep him locked down. When all that Tillman holds dear is taken away in a vicious act of violence, he is forced to confront the men responsible and take his revenge.  The birth of a legend.','https://image.tmdb.org/t/p/w500/yY2MV8dYotYtLYMiTcMvdxpNX5I.jpg','2017-08-04',5.2,0),(24669,'Black Mask','cn','Tsui Chik tries to lead a quiet life as a librarian. However, he is really a former test subject for a highly secretive supersoldier project and the instructor of a special commando unit dubbed \"701.\" The 701 squad is used for many government missions, but after one of the agents kills a team of policemen in an uncontrollable rage, the government decides to abort the project and eliminate all the subjects. Tsui Chik helped the surviving 701 agents flee the extermination attempt. Having escaped, Tsui Chik went separate ways from his team. Later, he discovers that the rest of the team were responsible for a violent crime spree that was beyond the capability of the local police. He sets out to stop them, donning a disguise and using the superhero alias of \"Black Mask\". Having lost the ability to feel pain due to the surgery performed on the super-soldiers by the military, Black Mask is almost invulnerable.','https://image.tmdb.org/t/p/w500/eEmG43S9o5C6XeFschoFQU4Bcub.jpg','1996-11-07',6.2,0),(24670,'Gray\'s Anatomy','en','The film documents, in an often dramatic and humorous fashion, Gray\'s investigations into alternative medicine for an eye condition (Macular pucker) he had developed.','https://image.tmdb.org/t/p/w500/oe7nbYwJj4gwk5oL0BiQMw7Eb0a.jpg','1996-09-11',6.7,0),(24671,'Breaking the Waves','da','In a small and conservative Scottish village, a woman\'s paralytic husband convinces her to have extramarital intercourse so she can tell him about it and give him a reason for living.','https://image.tmdb.org/t/p/w500/dQWMcdHXUOSHtr7ypOCa5T79JMS.jpg','1996-05-13',7.5,0),(24672,'Gunfight at the O.K. Corral','en','Lawman Wyatt Earp and outlaw Doc Holliday form an unlikely alliance which culminates in their participation in the legendary Gunfight at the O.K. Corral.','https://image.tmdb.org/t/p/w500/71AQUFbw49ALCNtKZ69flFmbRhF.jpg','1957-05-30',7,0),(24673,'Bunks','en','When two trouble-making brothers scam their way into an idyllic summer camp, they find themselves leading a rag tag cabin of boys into breaking every rule in the book.','https://image.tmdb.org/t/p/w500/rjjM5UtH95Er9mkLqayn0XuBmbk.jpg','2013-10-27',6,0),(24674,'Urban Legend','en','A college campus is plagued by a vicious serial killer murdering students in ways that correspond to various urban legends.','https://image.tmdb.org/t/p/w500/zJs23wXpvHzSLnOayG0IzKllat0.jpg','1998-09-25',5.7,0),(24675,'Three Wishes for Cinderella','cs','Popelka, a resourceful and independent young girl, is a servant in her stepmother\'s house and confides her closest friend the owl. When she comes across three magical acorns, she\'s granted a single wish for each one of them.','https://image.tmdb.org/t/p/w500/rxsZrGh2sS2axwSN9T7SL1aznhH.jpg','1973-11-16',7.6,0),(24676,'I Love You, Man','en','Peter Klaven is a successful real estate agent who, upon getting engaged to the woman of his dreams, Zooey, discovers, to his dismay and chagrin, that he has no male friend close enough to serve as his Best Man. Peter immediately sets out to rectify the situation, embarking on a series of bizarre and awkward \"man-dates.\"','https://image.tmdb.org/t/p/w500/xr4zAYsvgTzvMMiWu6qCAP9WBer.jpg','2009-03-20',6.5,0),(24677,'The Flyboys','en','Two boys from a small town find their courage tested when they accidentally stow away aboard an airplane owned by the mob...','https://image.tmdb.org/t/p/w500/pQoxndesKFNyG3895L0yiVcVJUK.jpg','2008-08-15',7.7,0),(24678,'Wer','en','A defense attorney begins to suspect that her client, who is charged with the murders of a vacationing family, might be more than meets the eye.','https://image.tmdb.org/t/p/w500/AeoCw3ItN1LELfJvTQnXagADL0F.jpg','2013-11-16',6.3,0),(24679,'Marvel One-Shot: Item 47','en','Benny and Claire, a down-on-their-luck couple, find a discarded Chitauri weapon referred to as \'Item 47\'.','https://image.tmdb.org/t/p/w500/rfxvoRoZtBLUXJqLf8z9kgJWkKt.jpg','2012-09-13',6.5,0),(24680,'Maggie Simpson in The Longest Daycare','en','In this Oscar-nominated short from The Simpsons, Maggie must navigate an eventful first day in daycare. At the Ayn Rand School for Tots, Maggie is diagnosed with average intelligence. Barred from the gifted children, she longs to escape from her glue-guzzling classmates. But when a lonely caterpillar befriends her, she makes it her mission to save it from a ruthless butterfly smashing toddler','https://image.tmdb.org/t/p/w500/muCMEJrYw6B06Zttn879nYtCGvS.jpg','2012-07-12',6.9,0),(24681,'Batman Unmasked: The Psychology of \'The Dark Knight\'','en','Delve into the world of Batman and the vigilante justice that he brought to the city of Gotham. Batman is a man who, after experiencing great tragedy, devotes his life to an ideal--but what happens when one man takes on the evil underworld alone? Examine why Batman is who he is--and explore how a boy scarred by tragedy becomes a symbol of hope to everyone else.','https://image.tmdb.org/t/p/w500/e15wNHmLX7PJUo8lqzQRhwbX7PL.jpg','2008-07-15',7.5,0),(24682,'Sarah\'s Key','fr','On the night of 16 July 1942, ten year old Sarah and her parents are being arrested and transported to the Velodrome d\'Hiver in Paris where thousands of other jews are being sent to get deported. Sarah however managed to lock her little brother in a closet just before the police entered their apartment. Sixty years later, Julia Jarmond, an American journalist in Paris, gets the assignment to write an article about this raid, a black page in the history of France. She starts digging archives and through Sarah\'s file discovers a well kept secret about her own in-laws.','https://image.tmdb.org/t/p/w500/peGUaf6HrX7jSi1HifX64QJb7pm.jpg','2010-09-16',7.3,0),(24683,'Diorama','sv','As miscommunication and temptations abound, a couple\'s once-passionate marriage slowly unravels, narrated through humorous dioramas.','https://image.tmdb.org/t/p/w500/gQrjtU0B8nGu9fB3ZDkxcXA4lLE.jpg','2022-05-06',6.1,0),(24684,'The Beatles: Eight Days a Week - The Touring Years','en','The Beatles stormed through Europe\'s music scene in 1963, and, in 1964, they conquered America. Their groundbreaking world tours changed global youth culture forever and, arguably, invented mass entertainment as we know it today. All the while, the group were composing and recording a series of extraordinarily successful singles and albums. However the relentless pressure of such unprecedented fame, that in 1966 became uncontrollable turmoil, led to the decision to stop touring. In the ensuing years The Beatles were then free to focus on a series of albums that changed the face of recorded music.','https://image.tmdb.org/t/p/w500/A6q7Jy4vXgXXoCoHX4lpCaKvcMV.jpg','2016-09-15',7.6,0),(24685,'The Apparition','en','Plagued by frightening occurrences in their home, Kelly and Ben learn that a university\'s parapsychology experiment produced an entity that is now haunting them. The malevolent spirit feeds on fear and torments the couple no matter where they run. Desperate, Kelly and Ben turn to a paranormal researcher, but even with his aid, it may already be too late to save themselves from the terrifying presence.','https://image.tmdb.org/t/p/w500/jO45nIEQMWHE0I68aGls3mRJR8M.jpg','2012-08-23',4.4,0),(24686,'The Last Exorcism Part II','en','As Nell Sweetzer tries to build a new life after the events of the first movie, the evil force that once possessed her returns with an even more horrific plan.','https://image.tmdb.org/t/p/w500/260ztSWhGIYSLAjDC6smFWcdUSp.jpg','2013-02-28',4.7,0),(24687,'WarGames','en','High School student David Lightman has a talent for hacking. But while trying to hack into a computer system to play unreleased video games, he unwittingly taps into the Defense Department\'s war computer and initiates a confrontation of global proportions. Together with his girlfriend and a wizardly computer genius, David must race against time to outwit his opponent and prevent a nuclear Armageddon.','https://image.tmdb.org/t/p/w500/zZ1rN4LoPxKNfAp67Xl300WxVeD.jpg','1983-06-03',7.1,0),(24688,'Malizia 2000','it','The teenage son of an architect falls for an older woman, an attractive housewife of his father\'s client.','https://image.tmdb.org/t/p/w500/wsJ6Iojv0zbxaewlF1Fqvh3QfBl.jpg','1991-11-01',5.6,0),(24689,'Ladder 49','en','Under the watchful eye of his mentor, Captain Mike Kennedy, probationary firefighter Jack Morrison matures into a seasoned veteran at a Baltimore fire station. However, Jack has reached a crossroads  as the sacrifices he\'s made have put him in harm\'s way innumerable times and significantly impacted his relationship with his wife and kids.','https://image.tmdb.org/t/p/w500/aJWQNUUHVcI7kvlVdUzPS9J8XHt.jpg','2004-10-01',6.4,0),(24690,'Double Trouble','it','A stuntman and a saxophonist stand in for two billionaires threatened by killers.','https://image.tmdb.org/t/p/w500/lenzKtDEaH3SsI4eZJwvbUAL4IJ.jpg','1984-10-19',6.9,0),(24691,'The Rum Diary','en','Tired of the noise and madness of New York and the crushing conventions of late Eisenhower-era America, itinerant journalist Paul Kemp travels to the pristine island of Puerto Rico to write for a local San Juan newspaper run by the downtrodden editor Lotterman. Adopting the rum-soaked lifestyle of the late ‘50s version of Hemingway’s \'The Lost Generation\', Paul soon becomes entangled with a very attractive American woman and her fiancée, a businessman involved in shady property development deals.  It is within this world that Kemp ultimately discovers his true voice as a writer and integrity as a man.','https://image.tmdb.org/t/p/w500/h0q4RUuc1CbKWwEtH3nt7KPcPWL.jpg','2011-10-13',5.9,0),(24692,'Sierra Burgess Is a Loser','en','A case of mistaken identity results in unexpected romance when the most popular girl in high school and the biggest loser must come together to win over their crushes.','https://image.tmdb.org/t/p/w500/vjnHRySiVM4YcBYzjCxw344y9g.jpg','2018-09-07',6.3,0),(24693,'Game of Death II','cn','In this dark tale of revenge, Bruce Lee \"returns\" as Billy Lo, whose best friend Chin Ku dies of a sudden illness. But suspicion of foul play arises when a gang tries to steal Ku\'s coffin at the funeral using a helicopter. When Lo\'s younger brother Lo hears about the incident, he leaves his Buddhist master to investigate the truth. His trail soon leads him to the Castle of Death, the last place Chin Ku was seen alive. There, he meets and befriends an unlikely ally--a cruel and merciless martial arts expert  who is also the tower\'s master. But when the master dies under mysterious circumstances, Lo ends up dueling with someone far more terrifying.','https://image.tmdb.org/t/p/w500/cdh9AcjheML92dQF4fHKY1CU5id.jpg','1981-03-21',5.6,0),(24694,'The Photographer of Mauthausen','es','Spanish photographer Francesc Boix, imprisoned in the Mauthausen-Gusen concentration camp, works in the SS Photographic Service. Between 1943 and 1945, he hides, with the help of other prisoners, thousands of negatives, with the purpose of showing the freed world the atrocities committed by the Nazis, exhaustively documented. He will be a key witness during the Nuremberg Trials.','https://image.tmdb.org/t/p/w500/6b4L0uLVgFsDfqPx0sFZbCRwIKH.jpg','2018-10-26',7,0),(24695,'Miracle','en','When college coach Herb Brooks is hired to helm the 1980 U.S. men\'s Olympic hockey team, he brings a unique and brash style to the ice. After assembling a team of hot-headed college all-stars, who are humiliated in an early match, Brooks unites his squad against a common foe: the heavily-favored Soviet team.','https://image.tmdb.org/t/p/w500/bQsgMzDjLKUpLzOoijuIWPJvaf0.jpg','2004-02-06',7.1,0),(24696,'Scooby-Doo and the Ghoul School','en','Scooby, Shaggy and Scrappy Doo are on their way to a Miss Grimwood\'s Finishing School for Girls, where they have been hired as gym teachers. Once there, however, they find that it is actually a school for girl ghouls.','https://image.tmdb.org/t/p/w500/duMdoHLQvnzRDZm2CD66DT4PvS5.jpg','1988-10-16',7.4,0),(24697,'Primer','en','Friends and fledgling entrepreneurs invent a device in their garage which reduces the apparent mass of any object placed inside it, but they discover that it has some highly unexpected capabilities - ones that could enable them to do and to have seemingly anything they want. Taking advantage of this unique opportunity is the first challenge they face. Dealing with the consequences is the next.','https://image.tmdb.org/t/p/w500/xEoq2WmDzpzxhkHEsmOYOg6BPg6.jpg','2004-10-08',6.8,0),(24698,'The Golden Child','en','After a Tibetan boy, the mystical Golden Child, is kidnapped by the evil Sardo Numspa, humankind\'s fate hangs in the balance. On the other side of the world in Los Angeles, the priestess Kee Nang seeks the Chosen One, who will save the boy from death. When Nang sees social worker Chandler Jarrell on television discussing his ability to find missing children, she solicits his expertise, despite his skepticism over being \"chosen.\"','https://image.tmdb.org/t/p/w500/nVJIyS2gh0hBvVEr8s9SrpSBTxL.jpg','1986-12-12',5.9,0),(24699,'Erased','en','A former agent of the CIA and his estranged daughter go on the run after his employers target them for assassination.','https://image.tmdb.org/t/p/w500/m9pUIC2lp40KvDxdiCRP7PFjXYs.jpg','2012-08-23',6,0),(24700,'Phenomena','en','A young girl, with an amazing ability to communicate with insects, is transferred to an exclusive Swiss boarding school, where her unusual capability might help solve a string of murders.','https://image.tmdb.org/t/p/w500/dhk14s8ogQkbf6re3HLKV2UBHjx.jpg','1985-01-25',6.8,0),(24701,'*batteries not included','en','In a soon to be demolished block of apartments, the residents resist the criminal methods used to force them to leave so a greedy tycoon can build his new skyscraper. When tiny mechanical aliens land for a recharge, they decide to stay and help out.','https://image.tmdb.org/t/p/w500/8NkpnpdLd8J6zCR8ZGTeGTur4uO.jpg','1987-12-18',6.7,0),(24702,'A Trash Truck Christmas','en','When Santa crash-lands in the junkyard on Christmas Eve, Hank, Trash Truck and their animal friends all have a hand in rescuing the holiday for everyone.','https://image.tmdb.org/t/p/w500/2kWVSZfK9gbbNQD93Qwi8VvYjlB.jpg','2020-12-11',6.4,0),(24703,'Manhunt','zh','Accused of a murder he didn\'t commit, a prosecutor sets out on a mission to clear his name.','https://image.tmdb.org/t/p/w500/qZExZe5R4piUOvm8Wn6ZrVgC1e1.jpg','2017-11-19',5.7,0),(24704,'Wheelman','en','A getaway driver for a bank robbery realizes he has been double crossed and races to find out who betrayed him.','https://image.tmdb.org/t/p/w500/yeHRsKOlNDsbEIALS1ve6S42Nl6.jpg','2017-10-20',6.1,0),(24705,'Persuasion','en','Persuasion is the newest adaptation of the classic Jane Austen novel of the same name published in 1818. Anne falls deeply in love with handsome young naval officer Frederick Wentworth at the age of nineteen.','https://image.tmdb.org/t/p/w500/p0SAkCFD02wj2gekOvFilMjzs3j.jpg','2007-04-01',7.4,0),(24706,'The Purity of Vengeance','da','Copenhagen, Denmark, 2018. A frightening discovery is made in an old apartment. The subsequent investigation of Department Q members leads them to an infamous institution for girls that was suddenly closed in the early sixties.','https://image.tmdb.org/t/p/w500/uTdaeGpznkLfyhAzLlrdssD621R.jpg','2018-10-04',7.2,0),