ress.','https://image.tmdb.org/t/p/w500/iH8Ohx97F2eIagrJGzCEraO93MN.jpg','1967-02-01',7.1,0),(24714,'Antrum','en','Rumored to have been lost, Antrum appears as a cursed film from the 1970s. Viewers are warned to proceed with caution. It’s said to be a story about a young boy and girl who enter the forest in an attempt to save the soul of their recently deceased pet. They journey to “The Antrum,” the very spot the devil landed after being cast out of heaven. There, the children begin to dig a hole to hell.','https://image.tmdb.org/t/p/w500/20de4Rcmy4B0L5zyOc3Nc5F7c0D.jpg','2018-10-14',5.9,0),(24715,'The Killing Fields','en','The real-life story of a friendship between two journalists, an American and a Cambodian, during the bloody Khmer Rouge takeover of Cambodia in 1975, which led to the death of 2-3 million Cambodians during the next four years, until Pol Pot\'s regime was toppled by the intervening Vietnamese in 1979.','https://image.tmdb.org/t/p/w500/cX6Bv7natnZwQjsV9bLL8mmWjkS.jpg','1984-11-23',7.5,0),(24716,'Row 19','ru','A young female doctor and her 6-year-old daughter are on an overnight flight in a violent storm. When passengers on the half-empty plane inexplicably begin to die, the woman’s grip on reality weakens and she is forced to relive her worst childhood nightmare.','https://image.tmdb.org/t/p/w500/ymLXnBDKHXVCLYBoSnY9mhlQynH.jpg','2021-11-11',5.8,0),(24717,'Kajillionaire','en','Two con artists have spent 26 years training their only daughter to swindle, scam and steal at every turn. During a desperate and hastily conceived heist, they charm a stranger into joining them, only to have their entire world turned upside down.','https://image.tmdb.org/t/p/w500/fkqJJDb4u9rEyJu8Jm8H1P2mux4.jpg','2020-09-25',6.3,0),(24718,'One Direction: This Is Us','en','\"One Direction: This Is Us\" is a captivating and intimate all-access look at life on the road for the global music phenomenon. Weaved with stunning live concert footage, this inspiring feature film tells the remarkable story of Niall, Zayn, Liam, Harry and Louis\'s really like to be One Direction.','https://image.tmdb.org/t/p/w500/cxIoYa7uboxiDvWGxdad6fvgpcH.jpg','2013-08-29',8.4,0),(24719,'The Howling: Reborn','en','On the eve of his high school graduation, unremarkable Will Kidman finally bonds with the girl he has long yearned for, reclusive Eliana Wynter. But he also discovers a dark secret from his past... that he is about to become a werewolf. Now, in an effort to fight destiny and save their love as well as their lives, they must battle not only Will\'s growing blood lust but an army of fearsome beasts bent on killing them... and then, us all.','https://image.tmdb.org/t/p/w500/8BSPC26lfw1WThhDaYaRMe6OBj.jpg','2011-10-18',4.8,0),(24720,'Straight from the Barrio','es','A young drug dealer falls in love while facing disruption among the men in his gang, and being offered a career as a Reggaetón singer.','https://image.tmdb.org/t/p/w500/5LIlCFEQnlCWpsd1HYmvhY5JHpq.jpg','2008-10-10',7.9,0),(24721,'The Laundromat','en','When her idyllic vacation takes an unthinkable turn, Ellen Martin begins investigating a fake insurance policy, only to find herself down a rabbit hole of questionable dealings that can be linked to a Panama City law firm and its vested interest in helping the world\'s wealthiest citizens amass larger fortunes.','https://image.tmdb.org/t/p/w500/hwNMJgbiUUvPCxsnADjbV9ysM5j.jpg','2019-09-27',6,0),(24722,'Warlock','en','In 17th century New England, witch hunter Giles Redferne captures an evil warlock, but the conjurer eludes death with supernatural help. Flung into the future, the warlock winds up in the 1980s and plans to bring about the end of the world. Redferne follows the enchanter into the modern era and continues his mission, but runs into trouble in such unfamiliar surroundings. With the help of a young woman, can Redferne finally defeat the warlock?','https://image.tmdb.org/t/p/w500/1QHjr4lBd3vBN4kEqdDFlnJbsa7.jpg','1989-06-01',6.3,0),(24723,'The Secret','fr','Marie, who works as a successful door-to-door encyclopedia salesperson, has been married to her husband Francois for 12 years and has a two-year-old son. Though she is relatively content with her life, she feels something is wanting. Enter 50-year old African-American Bill. Initially she is annoyed by his insouciance, but she finds that she is irresistibly attracted to him. Soon the two are in the midst of sordid illicit affair. She knows little about her new lover, and he seems uninterested in learning about her, but the long sessions of lovemaking are something else entirely. Feeling out of control, Marie is increasingly repelled by her own actions. Psychologically, she struggles to reconcile her torrid encounters with Bill and mundane domestic chores such as bathing her son. Moreover, she finds herself incapable of hiding her adulterous behavior, rather she comes home with scratches and hickeys all over her body, to the devastation Francois.','https://image.tmdb.org/t/p/w500/mKAnyMIN9vXY5yw9siOGMU7Ko5g.jpg','2000-11-01',7.1,0),(24724,'Bend It Like Beckham','en','Jess Bhamra, the daughter of a strict Indian couple in London, is not permitted to play organized soccer, even though she is 18. When Jess is playing for fun one day, her impressive skills are seen by Jules Paxton, who then convinces Jess to play for her semi-pro team. Jess uses elaborate excuses to hide her matches from her family while also dealing with her romantic feelings for her coach, Joe.','https://image.tmdb.org/t/p/w500/6F2tFbxgqcSIMK5WOZfwoHXaROc.jpg','2002-04-11',6.3,0),(24725,'Dead Space: Aftermath','en','The year is 2509 and not only has Earth lost contact with the Ishimura and Isaac Clarke, but now also the USG O\'Bannon, the first responder ship sent to rescue them. Four crew members of the O\'Bannon have survived. But what happened to the rest of the crew? What were they doing? What secrets are they keeping? All to be revealed...in the Aftermath! --- Dead Space: Aftermath is a fast paced, horrifying thrill ride told through the perspective of the four survivors by several renowned international directors. Dead Space: Aftermath is an animated film that bridges the storyline between the video games Dead Space and Dead Space 2.','https://image.tmdb.org/t/p/w500/kDwKTOiJT7mkKjJRBUp2PDdIXV7.jpg','2011-01-25',6,0),(24726,'Sleepaway Camp II: Unhappy Campers','en','Angela Baker escapes from a mental hospital and surfaces at a summer camp as a counselor who lectures her teenage charges on proper moral behavior. Those teens who break her strict rules -- from the camp chatterbox or a sex-obsessed girl to the boys who are peeping Toms -- are murdered by the impostor in various gruesome ways. As more campers go missing, intrepid counselor Molly begins to piece together the truth.','https://image.tmdb.org/t/p/w500/stO1MtF6t11DVHVDpoKtQyixwRU.jpg','1988-10-31',5.9,0),(24727,'School Life','fr','The daily life of a school located in Saint Denis.','https://image.tmdb.org/t/p/w500/m0EmaEJmB02iIBA1YWQZGYVLBjA.jpg','2019-08-28',7,0),(24728,'Mighty Joe Young','en','As a child living in Africa, Jill Young saw her mother killed while protecting wild gorillas from poachers led by Andrei Strasser. Now an adult, Jill cares for an orphaned gorilla named Joe -- who, due to a genetic anomaly, is 15 feet tall. When Gregg O\'Hara arrives from California and sees the animal, he convinces Jill that Joe would be safest at his wildlife refuge. But Strasser follows them to the U.S., intent on capturing Joe for himself.','https://image.tmdb.org/t/p/w500/uK4qhBtKOuDvxX2HGDltke0v9iN.jpg','1998-12-25',6.2,0),(24729,'Our Friend','en','After learning that his terminally ill wife has six months to live, a man welcomes the support of his best friend who moves into their home to help out.','https://image.tmdb.org/t/p/w500/vg9C5LttsKBqoLuqeQvOXaeBGiD.jpg','2019-02-25',7.2,0),(24730,'Penelope','en','Forlorn heiress Penelope Wilhern is cursed, and the only way out is to fall in love with someone of suitable stock. But how can she find her soul mate when she\'s sequestered inside her family\'s estate with only her parents to keep her company. This untraditional fairy tale about a girl who bucks convention to create her own happy ending.','https://image.tmdb.org/t/p/w500/eZDxWKfCYxUE53Ke02AE5yjU1o0.jpg','2006-03-01',6.7,0),(24731,'Half Baked','en','Three lovable party buds try to bail their friend out of jail. But just when the guys have mastered a plan, everything comes dangerously close to going up in smoke.','https://image.tmdb.org/t/p/w500/14TmEac4bquNaEld9t0uIliYoKE.jpg','1998-01-16',6.3,0),(24732,'A Hidden Life','en','Austrian farmer Franz Jägerstätter faces the threat of execution for refusing to fight for the Nazis during World War II.','https://image.tmdb.org/t/p/w500/rdG4jfH0rxkB2FgkYmjj9V4Q31M.jpg','2019-12-11',7.2,0),(24733,'3-Headed Shark Attack','en','The world’s greatest killing machine is three times as deadly when a mutated shark threatens a cruise ship. As the shark eats its way from one end of the ship to the next, the passengers fight the deadly predator using anything they can find.','https://image.tmdb.org/t/p/w500/47lLJNQJQaooewVhXEHxWwbSztc.jpg','2015-07-20',4.6,0),(24734,'Stay on Board: The Leo Baker Story','en','Celebrated skateboarder Leo Baker shares the details of their rise to fame and the clash between their career and self-discovery as a trans person.','https://image.tmdb.org/t/p/w500/ruG51Utn1n3Iy5BoQm9iz1wAs0e.jpg','2022-08-11',6.1,0),(24735,'Love Wedding Repeat','en','While trying to make his sister\'s wedding day go smoothly, Jack finds himself juggling an angry ex-girlfriend, an uninvited guest with a secret, a misplaced sleep sedative, and the girl that got away in alternate versions of the same day.','https://image.tmdb.org/t/p/w500/u0MV99rB1hv8tkjtBJHfwIGCVKD.jpg','2020-04-10',5.6,0),(24736,'The Earthquake','ru','After the devastating Spitak earthquake of December 7th, Konstantin Berezhnoy, a 50-year-old Russian, and Robert Melkonyan, a 28-year-old Armenian, work together to rescue the desperate survivors.','https://image.tmdb.org/t/p/w500/3ZIZyE7GSL4bnzUzljTwPcSYThW.jpg','2016-12-01',6.6,0),(24737,'Unfinished Business','en','A hard-working small business owner and his two associates travel to Europe to close the most important deal of their lives.  But what began as a routine business trip goes off the rails in every imaginable – and unimaginable – way, including unplanned stops at a massive sex fetish event and a global economic summit.','https://image.tmdb.org/t/p/w500/eVWVZf3fkx9eNqbHyn9xNlmC2h4.jpg','2015-03-05',5.4,0),(24738,'Banana','en','The Minions fight over a delicious banana... but is that all they want?!','https://image.tmdb.org/t/p/w500/AnmIMKAQjXLjD2DI0ba4D9DpkHv.jpg','2010-12-13',7.2,0),(24739,'Navy Seals vs. Zombies','en','A team of highly skilled Navy SEALS find themselves embarking on the battle of their lives when they come face-to-face with the undead. After a deadly outbreak occurs in New Orleans, the SEALS must fight for their lives, and the city, against an army of zombies.','https://image.tmdb.org/t/p/w500/oTvwjUMXjeKxAXY2Cggy5DZweMn.jpg','2015-10-08',4.9,0),(24740,'Gold','en','Kenny Wells, a modern-day prospector, hustler, and dreamer, is desperate for a lucky break. Left with few options, Wells teams up with an equally luckless geologist to execute a grandiose, last-ditch effort: to find gold deep in the uncharted jungle of Indonesia.','https://image.tmdb.org/t/p/w500/ukMXAdr325Tn1mLGkxdG8Lab16l.jpg','2016-02-03',6.6,0),(24741,'The Last American Virgin','en','The friendship of a group of young friends struggling with teen sex, drugs, and work is jeopardized by a romantic interest which may turn pals into bitter rivals.','https://image.tmdb.org/t/p/w500/yeuzZJPKgRwyzmJIr71vZQgdu3H.jpg','1982-06-26',6.6,0),(24742,'Cracks','en','Jealousy flares after the headmistress of an elite boarding school for girls becomes obsessed with a new student.','https://image.tmdb.org/t/p/w500/pSVWV04CAWfswP6rqiKJWv0XWzE.jpg','2009-12-04',6.7,0),(24743,'That Obscure Object of Desire','fr','After dumping a bucket of water on a beautiful young woman from the window of a train car, wealthy Frenchman Mathieu, regales his fellow passengers with the story of the dysfunctional relationship between himself and the young woman in question, a fiery 19-year-old flamenco dancer named Conchita. What follows is a tale of cruelty, depravity and lies -- the very building blocks of love.','https://image.tmdb.org/t/p/w500/9iUdC4dftkjYSBUJq5DAxC6WqB9.jpg','1977-08-17',7.5,0),(24744,'Forgive Us Our Trespasses','en','Targeted by Nazis as they hunt down and murder people with disabilities, a boy with a limb difference makes a daring decision while running for his life.','https://image.tmdb.org/t/p/w500/4RYZSHM3eaxXAnjbgNiVaqmekL8.jpg','2022-01-17',6.2,0),(24745,'Laurence Anyways','fr','The story of an impossible love between a woman named Fred and a transgender woman named Laurence who reveals her inner desire to become her true self.','https://image.tmdb.org/t/p/w500/d8BpJ9qOQE7VFFqaV1XDdGfMsP7.jpg','2012-05-18',7.7,0),(24746,'Down','en','After the elevators at a New York City skyscraper begin inexplicably malfunctioning, putting its passengers at risk, mechanic Mark Newman and reporter Jennifer Evans begin separate investigations. Newman gets resistance from superiors at his company, which manufactured the elevator, while additional elevator incidents cause several gruesome deaths. The police get involved and suspect that terrorists are responsible, but a far stranger explanation looms.','https://image.tmdb.org/t/p/w500/jWPmTnu1zXZO3IFGIvNLQtjOkr7.jpg','2001-09-06',5.2,0),(24747,'Capturing the Killer Nurse','en','Charlie Cullen was an experienced registered nurse, trusted and beloved by his colleagues at Somerset Medical Center in New Jersey. He was also one of history’s most prolific serial killers, with a body count potentially numbering in the hundreds across multiple medical facilities in the Northeast.','https://image.tmdb.org/t/p/w500/384EXJadmQGmNMfB9nrGSBhCupO.jpg','2022-11-11',6.7,0),(24748,'The Absent One','da','Denmark, 2014. A former police officer asks Carl Mørck, head of Department Q, to find out who brutally killed his young twins in 1994. Although a local inhabitant confessed and was convicted of murder, Carl and his partner Assad soon realize that there is something in the case resolution that is terribly wrong.','https://image.tmdb.org/t/p/w500/4NJ5rel0BVJdacJIQAfu1y8628Z.jpg','2014-10-02',7.1,0),(24749,'Twinkle, Twinkle, Lucky Stars','cn','The third installment in the Lucky Stars series, following Winners and Sinners and My Lucky Stars. The team are released from prison to play detective in order to stop a ruthless gang from ruining their reputations, taking their lives, and that of a key witness in an upcoming trial. They must battle their way through and with the help of Muscles, take down the bad guys.','https://image.tmdb.org/t/p/w500/vTrU2SP1BCtt2RGeojA8torrPAM.jpg','1985-08-15',6.8,0),(24750,'Che: Part One','en','The Argentine, begins as Che and a band of Cuban exiles (led by Fidel Castro) reach the Cuban shore from Mexico in 1956. Within two years, they mobilized popular support and an army and toppled the U.S.-friendly regime of dictator Fulgencio Batista.','https://image.tmdb.org/t/p/w500/jWgPiVTmJsHWKVjAy2gvSFUH9yA.jpg','2008-09-05',6.8,0),(24751,'A Loud House Christmas','en','Lincoln Loud gears up for the ultimate Christmas, until he finds out that most of his sisters have plans to be elsewhere for the big day. Determined to remind his family that they all need to be together, Lincoln and his best friend Clyde McBride embark on a mission to preserve the family’s holiday traditions.','https://image.tmdb.org/t/p/w500/572kONypScXTz8detAOarXGbijI.jpg','2021-11-26',7.2,0),(24752,'Larry Crowne','en','When he suddenly finds himself without his long-standing blue-collar job, Larry Crowne enrolls at his local college to start over. There, he becomes part of an eclectic community of students and develops a crush on his teacher.','https://image.tmdb.org/t/p/w500/8GDM7RqM6J1vNUdlU94rmtlNa3e.jpg','2011-06-30',5.9,0),(24753,'The Furies','en','A young woman faces her darkest fears with seven other unwilling participants in a deadly game — a game that can only have one winner.','https://image.tmdb.org/t/p/w500/az3rk3vp1DmhM3KmpPNfDWW6mhN.jpg','2019-04-12',5.5,0),(24754,'City of Lies','en','Los Angeles Police Department detective Russell Poole has spent years trying to solve his biggest case -- the murders of The Notorious B.I.G. and Tupac Shakur -- but after two decades, the investigation remains open. Jack Jackson, a reporter desperate to save his reputation and career, is determined to find out why. In search of the truth, the two team up and unravel a growing web of institutional corruption and lies.','https://image.tmdb.org/t/p/w500/2CqyEyqvf5Z6jLRahozEV2vpcSS.jpg','2018-09-06',6.4,0),(24755,'Where the Heart Is','en','Novalee Nation is a 17-year-old Tennessee transient who has to grow up in a hurry when she\'s left pregnant and abandoned by her boyfriend on a roadside, and takes refuge in the friendly aisles of Wal-Mart. Eventually, some eccentric but kindly strangers \'adopt\' Novalee and her infant daughter, helping them buck the odds and build a new life.','https://image.tmdb.org/t/p/w500/2ylEQVilDE1iywh0RlebJmKRGbI.jpg','2000-04-27',7.1,0),(24756,'Sea of Love','en','Seen-it-all New York detective Frank Keller is unsettled - he has done twenty years on the force and could retire, and he hasn\'t come to terms with his wife leaving him for a colleague. Joining up with an officer from another part of town to investigate a series of murders linked by the lonely hearts columns he finds he is getting seriously and possibly dangerously involved with Helen, one of the main suspects.','https://image.tmdb.org/t/p/w500/7h88b3F0SUuwtV8QNnzz8d0aHW0.jpg','1989-09-15',6.6,0),(24757,'Wolf Creek','en','Stranded backpackers in remote Australia fall prey to a murderous bushman, who offers to fix their car, then takes them captive.','https://image.tmdb.org/t/p/w500/8NiRpqO3vx7ny6jagrEN61hu7qG.jpg','2005-09-16',6.2,0),(24758,'The Magdalene Sisters','en','Four women are given into the custody of the Magdalene sisterhood asylum to correct their sinful behavior: Crispina and Rose have given birth to a premarital child, Margaret got raped by her cousin and the orphan Bernadette had been repeatedly caught flirting with the boys. All have to work in a laundry under the strict supervision of the nuns, who break their wills through sadistic punishment.','https://image.tmdb.org/t/p/w500/akOnyPsfzcDvCwP3lzY35i2NIha.jpg','2002-08-30',7.5,0),(24759,'Street Fighter: The Legend of Chun-Li','en','When a teenager, Chun-Li witnesses the kidnapping of her father by wealthy crime lord M. Bison. When she grows up, she goes on a quest for vengeance and becomes the famous crime-fighter of the Street Fighter universe.','https://image.tmdb.org/t/p/w500/mLoSUrNME7L19fxu5dBUrU9UJ4h.jpg','2009-02-27',4.4,0),(24760,'Battleship Potemkin','ru','A dramatized account of a great Russian naval mutiny and a resultant public demonstration, showing support, which brought on a police massacre. The film had an incredible impact on the development of cinema and is a masterful example of montage editing.','https://image.tmdb.org/t/p/w500/tjnaRiHUsxBADaOwrQpnTnjHVwi.jpg','1925-12-24',7.6,0),(24761,'Cats','en','A tribe of cats called the Jellicles must decide yearly which one will ascend to the Heaviside Layer and come back to a new Jellicle life.','https://image.tmdb.org/t/p/w500/aCNch5FmzT2WaUcY44925owIZXY.jpg','2019-12-19',4.2,0),(24762,'Velvet Buzzsaw','en','Big money artists and mega-collectors pay a high price when art collides with commerce. After a series of paintings by an unknown artist are discovered, a supernatural force enacts revenge on those who have allowed their greed to get in the way of art.','https://image.tmdb.org/t/p/w500/3rViQPcrWthMNecp5XnkKev6BzW.jpg','2019-02-01',5.4,0),(24763,'Ratchet & Clank','en','When the galaxy comes under the threat of a nefarious space captain, a mechanic and his newfound robot ally join an elite squad of combatants to save the universe.','https://image.tmdb.org/t/p/w500/649xP2LST4VIrZ5cLPw7Ys9movF.jpg','2016-04-13',5.8,0),(24764,'Wasp Network','en','Havana, Cuba, 1990. René González, an airplane pilot, unexpectedly flees the country, leaving behind his wife Olga and his daughter Irma, and begins a new life in Miami, where he becomes a member of an anti-Castro organization.','https://image.tmdb.org/t/p/w500/fzjbeyEwmlpxu5CMzmFz8IDVELm.jpg','2020-01-29',6.1,0),(24765,'Pusher','da','A drug pusher grows increasingly desperate after a botched deal leaves him with a large debt to a ruthless drug lord.','https://image.tmdb.org/t/p/w500/8z2avGSJmoFdKNYaktA7QWe7m2C.jpg','1996-08-30',7,0),(24766,'Jane Got a Gun','en','After her outlaw husband returns home shot with eight bullets and barely alive, Jane reluctantly reaches out to an ex-lover who she hasn\'t seen in over ten years to help her defend her farm when the time comes that her husband\'s gang eventually tracks him down to finish the job.','https://image.tmdb.org/t/p/w500/lef7Fnj3gOoFKNYpuZ8qq1FBj55.jpg','2015-12-31',5.8,0),(24767,'The Long Walk Home','en','Two women, black and white, in 1955 Montgomery Alabama, must decide what they are going to do in response to the famous bus boycott led by Martin Luther King.','https://image.tmdb.org/t/p/w500/7T2oVjLHHIDY6FQH9e04oOgPWQa.jpg','1990-12-21',7.4,0),(24768,'Ace High','it','After Cacopoulos manages to save himself from being hung on a false charge, he robs Cat Stevens and Hutch Bessy of a lot of money and steals their horses. This results in a merry chase and Stevens and Bessy become unwilling allies in Cacopoulus\' revenge against the people who deserted him and framed him to get their money back.','https://image.tmdb.org/t/p/w500/99t363dwsbQ6PXiz5lhGaKmzFCy.jpg','1968-10-02',6.5,0),(24769,'Wonder Wheel','en','The story of four characters whose lives intertwine amid the hustle and bustle of the Coney Island amusement park in the 1950s: Ginny, an emotionally volatile former actress now working as a waitress in a clam house; Humpty, Ginny’s rough-hewn carousel operator husband; Mickey, a handsome young lifeguard who dreams of becoming a playwright; and Carolina, Humpty’s long-estranged daughter, who is now hiding out from gangsters at her father’s apartment.','https://image.tmdb.org/t/p/w500/gKYpAL1A01T9a1taGXAyfqXjI5x.jpg','2017-12-01',6.4,0),(24770,'The Final Girls','en','A young woman grieving the loss of her mother, a famous scream queen from the 1980s, finds herself pulled into the world of her mom\'s most famous movie. Reunited, the women must fight off the film\'s maniacal killer.','https://image.tmdb.org/t/p/w500/gQYKSRVo5iZACFOY6x50RblI6rx.jpg','2015-10-09',6.4,0),(24771,'Duplex','en','When a young couple buys their dream home, they have no idea what the sweet little old lady upstairs is going to put them through!','https://image.tmdb.org/t/p/w500/qM4pY3ODOgV0HygDkYh6Y9oyxhZ.jpg','2003-09-26',6.1,0),(24772,'The Main Event','en','After discovering a magical mask, an 11-year-old aspiring wrestler enters a competition to become the next WWE superstar by using special powers from a magical mask.','https://image.tmdb.org/t/p/w500/tzg5AEEu1T7nFOCq4gKbGBObhdk.jpg','2020-04-10',6.8,0),(24773,'Cabin Fever 2: Spring Fever','en','A high school prom faces a deadly threat: a flesh-eating virus that spreads via a popular brand of bottled water.','https://image.tmdb.org/t/p/w500/RmQpuArPv71IuDLn8CP710fNgk.jpg','2009-08-11',4.5,0),(24774,'The Secret in Their Eyes','es','A retired legal counselor writes a novel hoping to find closure for one of his past unresolved homicide cases and for his unreciprocated love with his superior - both of which still haunt him decades later.','https://image.tmdb.org/t/p/w500/r3FctmAMk2tbrwxuWdpeLrZLwIz.jpg','2009-08-13',8,0),(24775,'Los perros','es','Mariana, an upper-class Chilean, feels a strange attraction towards her riding teacher, Juan, a former colonel with a shady past.','https://image.tmdb.org/t/p/w500/qhZNSZjasVcgtzZ9s6cTj03X6xy.jpg','2017-10-12',5.6,0),(24776,'Breaking In','en','Shaun Russell takes her son and daughter on a weekend getaway to her late father\'s secluded, high-tech vacation home in the countryside. The family soon gets an unwelcome surprise when four men break into the house to find hidden money. After managing to escape, Shaun must now figure out a way to turn the tables on the desperate thieves and save her captive children.','https://image.tmdb.org/t/p/w500/nuCxJwcQOEKYoiHTgcf4em8TxWv.jpg','2018-05-05',6,0),(24777,'The Current War','en','Electricity titans Thomas Edison and George Westinghouse compete to create a sustainable system and market it to the American people.','https://image.tmdb.org/t/p/w500/eqTjO8yTaPRSKWj7i6Qnr7R5cls.jpg','2018-02-01',6.7,0),(24778,'Blank Check','en','Bullied by his siblings and nagged by his parents, 11-year-old Preston is fed up with his family -- especially their frugality. But he gets his chance to teach them a lesson when a money-laundering criminal nearly bulldozes Preston with his car and gives the boy a blank check as compensation. Preston makes the check out for $1 million and goes on a spending spree he\'ll never forget. Maybe now, his family will take him seriously!','https://image.tmdb.org/t/p/w500/wmr5yiWbfM1LlOpkNTQ1pHDipUE.jpg','1994-02-11',5.8,0),(24779,'Pale Rider','en','A mysterious preacher protects a humble prospector village from a greedy mining company trying to encroach on their land.','https://image.tmdb.org/t/p/w500/kpAN5WnDEVWYzMDPkXHTbrDQuak.jpg','1985-06-28',7.2,0),(24780,'The Siege of Jadotville','en','Irish Commandant Pat Quinlan leads a stand off with troops against French and Belgian Mercenaries in the Congo during the early 1960s.','https://image.tmdb.org/t/p/w500/adrno1y0mKpMwjSlMQojZEUk82V.jpg','2016-09-19',7.2,0),(24781,'Easter Sunday','en','A man returns home for an Easter celebration with his riotous, bickering, eating, drinking, laughing, loving family, in this love letter to the Filipino-American community.','https://image.tmdb.org/t/p/w500/peyxSGjFpLdoxfvojrYEiTqfEAu.jpg','2022-08-05',6,0),(24782,'The Reckoning','en','In the aftermath of the Great Plague and amidst the subsequent witch-hunts against women, a young widow grapples with the tragic death of her husband in a society completely consumed by fear and death. Because she rejects the advances of her landlord, she is falsely accused of being a witch and thrown in jail for a crime she didn’t commit. She must endure physical persecution at the hands of England’s most ruthless witch-hunter and face her own inner demons as the devil himself starts to work his way into her mind.','https://image.tmdb.org/t/p/w500/yyduiC94r9oJMqGAfqjhW50g24s.jpg','2021-02-05',6.7,0),(24783,'Pinocchio','de','The world\'s most loved fairy tale is back in a whole new fantastic imagining in Pinocchio. When a piece of pine-wood falls into the hands of the poor old toy maker, Geppetto, he carves it into a puppet which he names Pinocchio. To Geppetto\'s delight, Pinocchio comes to life - and like most little boys, he\'s full of reckless whims and wild ideas! His crazy escapades lead him into a series of madcap adventures from joining the circus to visiting the inside of whale! Along his journey, and throughout all the fun, Pinocchio learns to be considerate and courageous and learns what it takes to become a real boy.','https://image.tmdb.org/t/p/w500/eLGpoWRAXZqRAjsMggmKwvAHKa6.jpg','2013-12-24',4.9,0),(24784,'Jurassic Greatest Moments: Jurassic Park to Jurassic World','en','Join the cast of \"Jurassic World Dominion\" as they relive their favorite unforgettable, action-packed and epic moments from the \"Jurassic World\" franchise.','https://image.tmdb.org/t/p/w500/tPdsrxdJBBIvJi5rwcnYGUoPAai.jpg','2022-06-04',6.2,0),(24785,'When the Bough Breaks','en','A surrogate mother harbors a deadly secret desire for a family of her own with the husband who is expecting to raise her child.','https://image.tmdb.org/t/p/w500/mHNAzwNJmEllFa5Lt1RjyyXoGMS.jpg','2016-09-09',5.8,0),(24786,'American Ninja 3: Blood Hunt','en','Jackson is back, and now he has a new partner, karate champion Sean, as they must face a deadly terrorist known as \"The Cobra\", who has infected Sean with a virus. Sean and Jackson have no choice but to fight the Cobra and his bands of ninjas.','https://image.tmdb.org/t/p/w500/oiKM4CAEXrhAfDkpnhBW8RpOQC7.jpg','1989-02-24',4.7,0),(24787,'The Crimson Pirate','en','Burt Lancaster plays a pirate with a taste for intrigue and acrobatics who involves himself in the goings on of a revolution in the Caribbean in the late 1700s. A light hearted adventure involving prison breaks, an oddball Scientist, sailing ships, naval fights, and tons of swordplay.','https://image.tmdb.org/t/p/w500/bx6WTlybfmCuutVfysGC9lms0qC.jpg','1952-08-27',7,0),(24788,'Strange Days','en','In the last days of 1999, ex-cop turned street hustler Lenny Nero receives a disc which contains the memories of the murder of a prostitute. With the help of bodyguard Mace, he starts to investigate and is pulled deeper and deeper in a whirl of murder, blackmail and intrigue. Can the pair live to see the new millennium?','https://image.tmdb.org/t/p/w500/dwstlGA74LujvsLpGGaxtBvgx67.jpg','1995-10-13',7,0),(24789,'Carne','fr','A butcher in Paris takes his revenge after his daughter is brutally attacked.','https://image.tmdb.org/t/p/w500/8r9i7OFgTVrj8EVOSCiSH53Tqmf.jpg','1991-05-01',6.8,0),(24790,'Marnie','en','Marnie is a thief, a liar, and a cheat. When her new boss, Mark Rutland, catches on to her routine kleptomania, she finds herself being blackmailed.','https://image.tmdb.org/t/p/w500/nRRy4VO2A3Py7wiZBPz11PAlogp.jpg','1964-07-17',7.2,0),(24791,'Marshall','en','Thurgood Marshall, the first African-American Supreme Court Justice, battles through one of his career-defining cases.','https://image.tmdb.org/t/p/w500/2KfdXsXTCbMie0wB1mSmIX60C2F.jpg','2017-10-13',7.3,0),(24792,'Leviathan','ru','In a Russian coastal town, Kolya is forced to fight the corrupt mayor when he is told that his house will be demolished. He recruits a lawyer friend to help, but the man\'s arrival brings further misfortune for Kolya and his family.','https://image.tmdb.org/t/p/w500/dwmHSBBiu2ow271zrQ33rPKZDSC.jpg','2014-09-24',7.4,0);
INSERT INTO `movies` VALUES (24793,'StreetDance 3D','en','In order to win the Street Dance Championships, a dance crew is forced to work with ballet dancers from the Royal Dance School in exchange for rehearsal space.','https://image.tmdb.org/t/p/w500/oqWSenAtDQsWjMLVTMEDvcCtafU.jpg','2010-05-19',6.4,0),(24794,'Eye for an Eye','en','It\'s fire and brimstone time as grieving mother Karen McCann takes justice into her own hands when a kangaroo court in Los Angeles fails to convict Robert Doob, the monster who raped and murdered her 17-year-old daughter.','https://image.tmdb.org/t/p/w500/y2lZSdJ1o0VvLegTw3ad6KFtxra.jpg','1996-01-12',6.1,0),(24795,'Young Guns II','en','Three of the original five \"young guns\" — Billy the Kid (Emilio Estevez), Jose Chavez y Chavez (Lou Diamond Phillips), and Doc Scurlock (Kiefer Sutherland) — return in Young Guns, Part 2, which is the story of Billy the Kid and his race to safety in Old Mexico while being trailed by a group of government agents led by Pat Garrett.','https://image.tmdb.org/t/p/w500/yHBkZP64e4TeNvJ56xydJDQjqD3.jpg','1990-08-01',6.5,0),(24796,'Secrets','tl','A story about a young couple who escapes to a beach house in order to sort out their relationship but finds themselves entangled in a trap set by a seductive stranger.','https://image.tmdb.org/t/p/w500/k80YkIrLzyrtgo26sktydcfJEWW.jpg','2022-06-10',4.8,0),(24797,'10','en','A Hollywood songwriter goes through a mid-life crisis and becomes infatuated with a sexy blonde newlywed.','https://image.tmdb.org/t/p/w500/kC8cInADdO6eUe94d8rv3GTT0Ng.jpg','1979-10-05',5.6,0),(24798,'Voy a pasármelo bien','es','David and Layla, two teenagers who really like \"G-Men\" and they like each other too, but everything he does to win her over ends badly. Thirty years later they meet again and realize that the feelings have not completely disappeared.','https://image.tmdb.org/t/p/w500/lcThPhR67aaPEu5s8EGrkcL0w3m.jpg','2022-08-05',6.7,0),(24799,'Music','en','Zu, a free spirit estranged from her family, suddenly finds herself the sole guardian of her half-sister, Music, a teenager on the autism spectrum whose whole world order has been beautifully crafted by her late grandmother. The film soon challenges whether it is Zu or Music who has a better view of the world, and that love, trust, and being able to be there for each other is everything.','https://image.tmdb.org/t/p/w500/xzDXq7ofNkvIovB6Vb8KZpjqkK0.jpg','2021-01-14',5.6,0),(24800,'Personal Shopper','en','Maureen, mid-20s, is a personal shopper for a media celebrity. The job pays for her stay in Paris, a city she refuses to leave until she makes contact with her twin brother who previously died there. Her life becomes more complicated when a mysterious person contacts her via text message.','https://image.tmdb.org/t/p/w500/uygGdDR0OEa3ZB3nwANtzOzU9Fa.jpg','2016-10-19',5.9,0),(24801,'Army of One','en','Gary Faulkner is an ex-con, unemployed handyman, and modern day Don Quixote who receives a vision from God telling him to capture Osama Bin Laden. Armed with only a single sword purchased from a home-shopping network, Gary travels to Pakistan to complete his mission. While on his quest, Gary encounters old friends back home in Colorado, the new friends he makes in Pakistan, the enemies he makes at the CIA - and even God and Osama themselves.','https://image.tmdb.org/t/p/w500/9XKBJovNQyNRQo382uQ7woFVJ5G.jpg','2016-11-04',5.3,0),(24802,'Man Bites Dog','fr','The activities of rampaging, indiscriminate serial killer Ben are recorded by a willingly complicit documentary team, who eventually become his accomplices and active participants. Ben provides casual commentary on the nature of his work and arbitrary musings on topics of interest to him, such as music or the conditions of low-income housing, and even goes so far as to introduce the documentary crew to his family. But their reckless indulgences soon get the better of them.','https://image.tmdb.org/t/p/w500/cT8XcigfWuD2hMZJJg6cXewv96F.jpg','1992-11-04',7.3,0),(24803,'St. Agatha','en','St. Agatha is set in the 1950s in small town Georgia. A pregnant con woman named Agatha is on the run and seeks refuge in a convent hidden in deafening isolation. What first starts out as the perfect place to have a child turns into a dark lair where silence is forced. Ghastly secrets are masked, and every bit of will power Agatha has is tested. She soon learns the sick and twisted truth of the convent and the odd people that lurk inside its halls. Agatha must now find a way to discover the unyielding strength needed to escape and save her baby before she’s caged behind these walls forever.','https://image.tmdb.org/t/p/w500/vfEn1cjQh4Mgcbnwim07hLy5aie.jpg','2018-04-20',5.6,0),(24804,'Mary Shelley\'s Frankenstein','en','Based on Mary Shelley\'s novel, \"Frankenstein\" tells the story of Victor Frankenstein, a promising young doctor who, devastated by the death of his mother during childbirth, becomes obsessed with bringing the dead back to life. His experiments lead to the creation of a monster, which Frankenstein has put together with the remains of corpses. It\'s not long before Frankenstein regrets his actions.','https://image.tmdb.org/t/p/w500/bOwCAQsZlEKrwhPi1ejY6BS8jpL.jpg','1994-11-04',6.4,0),(24805,'The Festival of Troubadours','tr','An unexpected reunion between a traveling musician and his son opens old wounds as the two set out on a long journey to a troubadour festival.','https://image.tmdb.org/t/p/w500/hcIhpCOj4JdvWMyaXUDXOqf7Opj.jpg','2022-09-02',6.3,0),(24806,'A Fall from Grace','en','When a law-abiding woman gets indicted for murdering her husband, her lawyer soon realizes that a larger conspiracy may be at work.','https://image.tmdb.org/t/p/w500/h47JJZ015VF4neia33AFwTU37Yb.jpg','2020-01-17',7.1,0),(24807,'Mac and Me','en','A Mysterious Alien Creature (MAC) escaping from nefarious NASA agents, is befriended by a young boy in a wheelchair. Together, they try to find MAC\'s family from whom he has been separated.','https://image.tmdb.org/t/p/w500/gZsIgK2W9K6e1ebNro3WT7u5yGX.jpg','1988-08-12',4.4,0),(24808,'The Baytown Outlaws','en','When three redneck brothers agree to help a woman save her son from an abusive father, they become targets on the run from an odd cast of characters.','https://image.tmdb.org/t/p/w500/oevsox25ZnoUBms45KARDs8epmg.jpg','2012-08-27',6,0),(24809,'A Turtle\'s Tale: Sammy\'s Adventures','en','A sea turtle who was hatched in 1959 spends the next 50 years traveling the world while it is being changed by global warming. Born on a Baja, California beach in 1959, new hatchling Sammy must do what his fellow newborn sea turtles are doing: race across the beach to the ocean before they are captured by a seagull or crab. Thus begins Sammy\'s incredible fifty-year ocean journey. Along the way he meets his best friend, a fellow turtle named Ray, and overcomes obstacles both natural and man-made while trying to fulfill his dream of travelling around the world. Throughout his voyage, Sammy never forgets about Shelly - the turtle he saved on his first day and loves passionately from afar.','https://image.tmdb.org/t/p/w500/n2lKNUSAgeZDDPcWHGUnRU89YkF.jpg','2010-08-03',6,0),(24810,'Goodbye First Love','fr','A 15-year-old discovers the joys and heartaches of first love with an older teen, but in the ensuing years, cannot seem to move past their breakup.','https://image.tmdb.org/t/p/w500/qj1P2hZJxMO3bXiC39JxbTWTNa5.jpg','2011-07-06',6.2,0),(24811,'The Guernsey Literary & Potato Peel Pie Society','en','Free-spirited writer Juliet Ashton forms a life-changing bond with the delightful and eccentric Guernsey Literary and Potato Peel Pie Society, when she decides to write about the book club they formed during the occupation of Guernsey in WWII.','https://image.tmdb.org/t/p/w500/2XcN2aIma8TqShsOBPbcpxLzY1A.jpg','2018-04-19',7.5,0),(24812,'Boys','nl','Two teen track stars discover first love as they train for the biggest relay race of their young lives.','https://image.tmdb.org/t/p/w500/khyK1mS3PoZ9q97VQ2BvR4YuNKN.jpg','2014-01-08',7.7,0),(24813,'The Golden Voyage of Sinbad','en','Sinbad and his crew intercept a homunculus carrying a golden tablet. Koura, the creator of the homunculus and practitioner of evil magic, wants the tablet back and pursues Sinbad. Meanwhile Sinbad meets the Vizier who has another part of the interlocking golden map, and they mount a quest across the seas to solve the riddle of the map.','https://image.tmdb.org/t/p/w500/z3ldjIJEknEotbm3O8oUkMVnagh.jpg','1973-12-20',6.6,0),(24814,'Beach Rats','en','On the outskirts of Brooklyn, Frankie, an aimless teenager, suffocates under the oppressive glare cast by his family and a toxic group of delinquent friends. Struggling with his own identity, Frankie begins to scour hookup sites for older men.','https://image.tmdb.org/t/p/w500/oQZPPsvoipd38jasPhvJOpajbug.jpg','2017-08-25',6,0),(24815,'Sandy Wexler','en','When a hapless but dedicated talent manager signs his first client who actually has talent, his career finally starts to take off.','https://image.tmdb.org/t/p/w500/38SDqWOt4utiLOnWlas7BfrYQGS.jpg','2017-04-14',5.5,0),(24816,'The Snowman','en','A young boy makes a snowman one Christmas Eve, which comes to life at midnight and takes him on a magical adventure to the North Pole to meet Santa Claus.','https://image.tmdb.org/t/p/w500/b3CMolkeXrPaVvd5vTsssMKfZZo.jpg','1982-12-26',7.6,0),(24817,'The Good Liar','en','Career con man Roy sets his sights on his latest mark: recently widowed Betty, worth millions. And he means to take it all. But as the two draw closer, what should have been another simple swindle takes on the ultimate stakes.','https://image.tmdb.org/t/p/w500/6kmxXfg3aSWrzUlEPt2L0YD4jz9.jpg','2019-11-08',6.7,0),(24818,'Urban Legends: Final Cut','en','The making of a horror movie takes on a terrifying reality for students at the most prestigious film school in the country. At Alpine University, someone is determined to win the best film award at any cost - even if it means eliminating the competition. No one is safe and everyone is a suspect.','https://image.tmdb.org/t/p/w500/9kjGrnhMz37RYEd5BFcrU1qkPkl.jpg','2000-09-22',4.8,0),(24819,'Spy Cat','de','Four crazy antiheroes on the run. Their leader is the unworldly innocent, naive Marnie, a house cat who is not allowed to leave the house and only knows about real life from television','https://image.tmdb.org/t/p/w500/lU2Cx5lbSNMxgeKQPDOhAUdw91y.jpg','2019-04-11',7,0),(24820,'Junior','en','As part of a fertility research project, a male scientist agrees to carry a pregnancy in his own body.','https://image.tmdb.org/t/p/w500/eQmgPrXf7c7daRdl3Zwgm65lw3o.jpg','1994-11-22',5.2,0),(24821,'Waiting for the Barbarians','en','At an isolated frontier outpost, a colonial magistrate suffers a crisis of conscience when an army colonel arrives looking to interrogate the locals about an impending uprising, using cruel tactics that horrify the magistrate.','https://image.tmdb.org/t/p/w500/k50gYFDfpAyxcIGjWjnXAaOM81e.jpg','2019-09-06',6,0),(24822,'Night School','en','Teddy Walker is a successful salesman whose life takes an unexpected turn when he accidentally blows up his place of employment. Forced to attend night school to get his GED, Teddy soon finds himself dealing with a group of misfit students, his former high school nemesis and a feisty teacher who doesn\'t think he\'s too bright.','https://image.tmdb.org/t/p/w500/uQVIQDc3foTPodZw0ie1Or0CXBn.jpg','2018-09-27',6.2,0),(24823,'Yours, Mine and Ours','en','When a widower with ten children marries a widow with eight, can the twenty of them ever come together as one big happy family?','https://image.tmdb.org/t/p/w500/sL6uuFSapJNAGYcA4SrUHO5X4gs.jpg','1968-04-24',6.8,0),(24824,'My Perfect Romance','en','Newly appointed CEO of Robinson Tech, Wes Robinson, is looking for new ideas to boost the company\'s sales. Vivian Blair, a program developer, shares a dating algorithm she has been working on called My Perfect Match. Wes sees potential and an opportunity to turn the company around and launches the service. When the pair is challenged to use My Perfect Match themselves to find love, this algorithm shows some interesting results.','https://image.tmdb.org/t/p/w500/o3v4J05QKJa2S62YL6zFgHpl9px.jpg','2018-02-14',5.5,0),(24825,'1900','it','The epic tale of a class struggle in twentieth century Italy, as seen through the eyes of two childhood friends on opposing sides.','https://image.tmdb.org/t/p/w500/deWzfCC59tmtEQvKSmflDe14FvR.jpg','1976-09-01',7.9,0),(24826,'Scoop','en','An American journalism student in London scoops a big story, and begins an affair with an aristocrat as the incident unfurls.','https://image.tmdb.org/t/p/w500/aHvZYoQNRTMrfs46pj64b9GrbaK.jpg','2006-07-27',6.6,0),(24827,'The Love Witch','en','A modern-day witch uses spells and magic to get men to fall in love with her, with deadly consequences.','https://image.tmdb.org/t/p/w500/eE3GGSkD8ziNOYgnWGoODlpOZPV.jpg','2016-11-11',6.3,0),(24828,'The Adventures of Priscilla, Queen of the Desert','en','Two drag queens and a transgender woman contract to perform a drag show at a resort in Alice Springs, a town in the remote Australian desert. As they head west from Sydney aboard their lavender bus, Priscilla, the three friends come to the forefront of a comedy of errors, encountering a number of strange characters, as well as incidents of homophobia, whilst widening comfort zones and finding new horizons.','https://image.tmdb.org/t/p/w500/oHvR5qtL1P42y2LPUuL6wBiru1f.jpg','1994-05-31',7.3,0),(24829,'McFarland, USA','en','A track coach in a small California town transforms a team of athletes into championship contenders.','https://image.tmdb.org/t/p/w500/oJ65tTWMYQiP6Ryv5KmVW86xhE7.jpg','2015-02-20',7.4,0),(24830,'Creation','en','A psychological, heart-wrenching love story that provides a unique and inside look at Charles Darwin. Torn between faith and science, he struggles to finish his legendary book \"On the Origin of the Species,\" which goes on to become the foundation for evolutionary biology.','https://image.tmdb.org/t/p/w500/vS6ne76vjRH7Z88rAqYLCcQatB4.jpg','2009-09-25',6.4,0),(24831,'The Devil Below','en','A group of four amateur adventurers who specialize in exploring remote and forsaken places pay a visit to Shookum Hills, a town in the remote Appalachian Mountains which was abandoned decades ago due to a mysterious coal mine fire.','https://image.tmdb.org/t/p/w500/bKpkB86oJ2IyIlpGLTF66zBPSDp.jpg','2021-03-05',5,0),(24832,'Python','en','Sleepy New Haven California is a small town with a big problem. A sixty foot slithering horror has arrived and shattered the town\'s tranquillity on it\'s path of death and destruction... Growing violent and more savage with each attack the gigantic creature soon becomes an unstoppable feeding machine raging beyond control of it\'s creator, leaving only the stripped bones of it\'s victims in it\'s wake.','https://image.tmdb.org/t/p/w500/lDbTpRHTRFWBK4j0FAWpE4M5WT2.jpg','2000-08-09',5.1,0),(24833,'Behind the Trees','en','While on a romantic getaway in the Indian wilderness, a couple from Los Angeles accidentally witnesses the haunting exorcism of an 11-year old girl. They decide to rescue her.','https://image.tmdb.org/t/p/w500/qodcodUkpuhN7eCZa15akRJIJg4.jpg','2019-11-21',5.7,0),(24834,'The White Tiger','en','An ambitious Indian driver uses his wit and cunning to escape from poverty and rise to the top. An epic journey based on the New York Times bestseller.','https://image.tmdb.org/t/p/w500/5JnmseS3DZ6ad2VMbrnbGCs8Rst.jpg','2021-01-13',7,0),(24835,'Hollow Point','en','When his wife and daughter are senselessly murdered, a grieving man finds himself caught up in a war between a group of charismatic vigilantes and the crime that infests their city.','https://image.tmdb.org/t/p/w500/8toDIronC85Qsd0EhKdtzJAIs4q.jpg','2019-06-13',6.6,0),(24836,'An Affair to Die For','en','A weekend get-away for two lovers turns into a nightmare of psychological mind games when their infidelity is discovered.','https://image.tmdb.org/t/p/w500/Vo4vUGaE081biscSRiacl9agmE.jpg','2019-02-01',6,0),(24837,'Ali: Fear Eats the Soul','de','Emmi Kurowski, a cleaning lady, is lonely in her old age. Her husband died years ago, and her grown children offer little companionship. One night she goes to a bar frequented by Arab immigrants and strikes up a friendship with middle-aged mechanic Ali. Their relationship soon develops into something more, and Emmi\'s family and neighbors criticize their spontaneous marriage. Soon Emmi and Ali are forced to confront their own insecurities about their future.','https://image.tmdb.org/t/p/w500/2dIkTSgrt4CvewAL4EWTraNAan1.jpg','1974-06-05',7.7,0),(24838,'Punch','en','Jim is preparing for his first professional fight but begins to rethink his life\'s trajectory and his sexuality after tangling with Whetu, a gay Maori boy who spends his days in an old shack down by the beach.','https://image.tmdb.org/t/p/w500/xCqfpzzdKMCyCZEqur0ugYnuwYL.jpg','2023-03-10',0,0),(24839,'Save The Tree','es','In the forests of the Pyrenees, there are still people who tell stories of trees... of fantastic beings with powers beyond our imagination. And with those trees, from the very moment in which their seeds sprout, a pixie becomes their inseparable companion.','https://image.tmdb.org/t/p/w500/hdzUP6mV5VlSWVffA4Y18k4LK62.jpg','2021-10-22',4.4,0),(24840,'Heidi','de','Heidi, is an eight-year-old Swiss orphan who is given by her aunt to her mountain-dwelling grandfather. She is then stolen back by her aunt from her grandfather to live in the wealthy Sesemann household in Frankfurt, Germany as a companion to Klara, a sheltered, disabled girl in a wheelchair. Heidi is unhappy but makes the best of the situation, always longing for her grandfather.','https://image.tmdb.org/t/p/w500/kxnhHaPOvh0cqMOAx5k0NnqhDqS.jpg','2015-12-10',7.1,0),(24841,'The Wicker Man','en','A sheriff investigating the disappearance of a young girl from a small island discovers there\'s a larger mystery to solve among the island\'s secretive, neo-pagan community.','https://image.tmdb.org/t/p/w500/9G6TBckQUKdx3dnn55abUCmonRX.jpg','2006-08-31',4.3,0),(24842,'Devil in a Blue Dress','en','In late 1940s Los Angeles, Easy Rawlins is an unemployed black World War II veteran with few job prospects. At a bar, Easy meets DeWitt Albright, a mysterious white man looking for someone to investigate the disappearance of a missing white woman named Daphne Monet, who he suspects is hiding out in one of the city\'s black jazz clubs. Strapped for money and facing house payments, Easy takes the job, but soon finds himself in over his head.','https://image.tmdb.org/t/p/w500/5lcJhwKGavLbPva17QkTBhLfqEk.jpg','1995-09-15',6.3,0),(24843,'Kiss and Cry','en','A romantic drama based on the story of Carley Allison, a promising 18 year old figure skater and singer who made medical history in her fight against a rare 1 in 3.5 billion type of sarcoma.','https://image.tmdb.org/t/p/w500/uHErYJ2TfP0ihIEMpD2zCvbVIIB.jpg','2017-02-10',7.3,0),(24844,'Picture of Beauty','en','In an early 20th century village, a painter with an unusual commission finds two pretty girls two model for him. The girls slowly come of age while exploring their sexuality and finding liberation in a repressed society.','https://image.tmdb.org/t/p/w500/mH9ngk8aY6a96rlMRoHcSMb1Wno.jpg','2017-03-14',4.2,0),(24845,'Maniac','en','As he helps a young artist with her upcoming exhibition, the owner of a mannequin shop\'s deadly, suppressed desires come to the surface.','https://image.tmdb.org/t/p/w500/sZswHknJ0H871AdsSt1bLzeEnYf.jpg','2012-12-26',6,0),(24846,'Model for Murder: The Centerfold Killer','en','Supermodels compete for a coveted centerfold spread as a merciless killer stalks the glamorous women. Meanwhile, two detectives attempt to unravel the mystery before the body count mounts.','https://image.tmdb.org/t/p/w500/6Kf49vsaVDdxcXavEeDrulRsrbD.jpg','2016-06-21',5.4,0),(24847,'An American Crime','en','The true story of suburban housewife Gertrude Baniszewski, who kept a teenage girl locked in the basement of her Indiana home during the 1960s.','https://image.tmdb.org/t/p/w500/aGATXFPK09klLs0JmxLKtCSyg24.jpg','2007-07-27',7.3,0),(24848,'Crossroads','en','A wanna-be blues guitar virtuoso seeks a long-lost song by legendary musician, Robert Johnson.','https://image.tmdb.org/t/p/w500/2sMo7gwZ8L7KttiW210T0ueJ2eX.jpg','1986-03-14',7.3,0),(24849,'Below','en','In the dark silence of the sea during World War II, the submarine USS Tiger Shark prowls on what should be a routine rescue mission. But for the shell-shocked crew, trapped together in the sub\'s narrow corridors and constricted spaces, this is about to become a journey into the sensory delusions, mental deceptions and runaway fears that lurk just below the surface of the ocean.','https://image.tmdb.org/t/p/w500/4tsaLD98DcXh4ltOn9wEWhsUkSc.jpg','2002-08-11',6.1,0),(24850,'The Land Before Time IV: Journey Through the Mists','en','Littlefoot and his dinosaur pals go in search of a medicinal flower that will cure his ailing grandfather.','https://image.tmdb.org/t/p/w500/sqBhPAvSwPCZq4Kg79CvxGrU7nj.jpg','1996-12-10',6.2,0),(24851,'Fatal Affair','en','Ellie tries to mend her marriage with her husband Marcus after a brief encounter with an old friend, David, only to find that David is more dangerous and unstable than she\'d realized.','https://image.tmdb.org/t/p/w500/f4EAJ6PXNbxBb2xrdTrT2SlJlCH.jpg','2020-07-16',5.7,0),(24852,'Rich in Love','pt','Working incognito at his rich dad\'s company to test his own merits, Teto falls for Paula and tells her he grew up poor, a lie that spins out of control.','https://image.tmdb.org/t/p/w500/wdgPgnPv6n7VaHXza54sWfWlQMU.jpg','2020-04-30',7.8,0),(24853,'Work It','en','A brilliant but clumsy high school senior vows to get into her late father\'s alma mater by transforming herself and a misfit squad into dance champions.','https://image.tmdb.org/t/p/w500/b5XfICAvUe8beWExBz97i0Qw4Qh.jpg','2020-08-07',7.6,0),(24854,'Hell Fest','en','On Halloween night at a horror theme park, a costumed killer begins slaying innocent patrons who believe that it\'s all part of the festivities.','https://image.tmdb.org/t/p/w500/qgLlnlrUtTKXkdrgMBwUfkyAkya.jpg','2018-09-27',5.7,0),(24855,'Killing Ground','en','A couple\'s camping trip turns into a frightening ordeal when they stumble across the scene of a horrific crime.','https://image.tmdb.org/t/p/w500/u7hkfmhQ1nohbXsZ7jIEZXqPI6n.jpg','2017-08-24',6,0),(24856,'Lost Girls & Love Hotels','en','Searching for escape in Tokyo\'s back alleys, a haunted English teacher explores love and lust with a dashing Yakuza, as their tumultuous affair takes her on a journey through the city\'s dive bars and three-hour love hotels.','https://image.tmdb.org/t/p/w500/vQgXwuJrlpzGDI8169tRQRy71Nv.jpg','2020-09-18',5.3,0),(24857,'Much Ado About Nothing','en','In this Shakespearean farce, Hero and her groom-to-be, Claudio, team up with Claudio\'s commanding officer, Don Pedro, the week before their wedding to hatch a matchmaking scheme. Their targets are sharp-witted duo Benedick and Beatrice -- a tough task indeed, considering their corresponding distaste for love and each other. Meanwhile, meddling Don John plots to ruin the wedding.','https://image.tmdb.org/t/p/w500/fA5mOQuevh4q18AAfy1xQWToVpp.jpg','1993-05-07',7,0),(24858,'The Little Witch','de','The little witch is only 127 years old – too young for the annual coven of witches. Although she is not yet old enough to be a real witch she wants to become a really good one. This decision causes trouble inside her magic world.','https://image.tmdb.org/t/p/w500/vTRg6yy75VQ0yoszgLQgp3MTHtE.jpg','2018-02-01',6.9,0),(24859,'Bring It On','en','The Toro cheerleading squad from Rancho Carne High School in San Diego has got spirit, spunk, sass and a killer routine that\'s sure to land them the national championship trophy for the sixth year in a row. But for newly-elected team captain Torrance, the Toros\' road to total cheer glory takes a shady turn when she discovers that their perfectly-choreographed routines were in fact stolen.','https://image.tmdb.org/t/p/w500/eTqBR0gpts9u0XCCv8shARdm8qr.jpg','2000-08-25',6.2,0),(24860,'Standoff','en','A troubled veteran gets a chance at redemption by protecting a girl from an assassin after she witnesses a murder. Holding a shotgun with a single shell, he engages in physical and psychological warfare in a desperate fight for the girl\'s life.','https://image.tmdb.org/t/p/w500/adlwQTs3zEo8EL2ta1IZebhoVPE.jpg','2016-02-26',6,0),(24861,'Pauline at the Beach','fr','Marion is about to divorce from her husband and takes her 15-year-old niece, Pauline, on a vacation to Granville. There, she meets an old love...','https://image.tmdb.org/t/p/w500/kjC8I6fvchcxPBdh4bw4w8Px8ue.jpg','1983-03-23',7,0),(24862,'Navalny','en','Follows the man who survived an assassination attempt by poisoning with a lethal nerve agent in August 2020. During his months-long recovery, he makes shocking discoveries about the attempt on his life and decides to return home.','https://image.tmdb.org/t/p/w500/49TwWrtOnJjVrMAUvkgrX6WWf11.jpg','2022-04-08',7.2,0),(24863,'How to Be Really Bad','de','The life of 14-year-old Lilith is similar to that of a normal teenager, but there is a peculiarity: she is the daughter of the devil and lives with him in hell. Because she is totally bored there and also wants to have fun and explore the world, she makes a pact with her father: she is allowed to go to earth for a week - but she has to convert a good person to evil there. If she succeeds in this challenge, she may stay on earth forever, otherwise she\'ll be waving a hell of a boring job in the bookkeeping of the underworld.','https://image.tmdb.org/t/p/w500/uz0NeJCLnWUNkzeL0bV2hfpbydk.jpg','2018-06-28',6.8,0),(24864,'Delivery Man','en','An affable underachiever finds out he\'s fathered 533 children through anonymous donations to a fertility clinic 20 years ago. Now he must decide whether or not to come forward when 142 of them file a lawsuit to reveal his identity.','https://image.tmdb.org/t/p/w500/dKTkxSeNgHdwgrAbhwbXuUk4tzb.jpg','2013-10-10',6.2,0),(24865,'Raise the Titanic','en','To obtain a supply of a rare mineral, a ship raising operation is conducted for the only known source, the Titanic.','https://image.tmdb.org/t/p/w500/a8u1FiMXdOlNfhHlpjAr48seQ2g.jpg','1980-08-01',5.5,0),(24866,'The Secret Garden','en','A young British girl born and reared in India loses her neglectful parents in an earthquake. She is returned to England to live at her uncle\'s castle. Her uncle is very distant due to the loss of his wife ten years before. Neglected once again, she begins exploring the estate and discovers a garden that has been locked and neglected. Aided by one of the servants\' boys, she begins restoring the garden, and eventually discovers some other secrets of the manor.','https://image.tmdb.org/t/p/w500/4QvQLpNMzprzjg4XwoDKjeqoYu0.jpg','1993-08-13',7.4,0),(24867,'Midnight Run','en','An accountant embezzles $15 million of mob money, jumps bail and is chased by bounty hunters, the FBI, and the Mafia.','https://image.tmdb.org/t/p/w500/avLXoDhPPbKgdOU7wsoVlOzYfUP.jpg','1988-07-20',7.2,0),(24868,'Havoc','en','A wealthy Los Angeles teen and her superficial friends wants to break out of suburbia and experience Southern California\'s \"gangsta\" lifestyle. But problems arise when the preppies get in over their heads and provoke the wrath of a violent Latino gang. Suddenly, their role-playing seems a little too real.','https://image.tmdb.org/t/p/w500/r4yMNUroIjxDz8T7zOZWUobQtta.jpg','2005-10-16',5.2,0),(24869,'The Final Wish','en','Following the passing of his father, Aaron Hammond returns to his hometown to help his devastated mother and to confront his past demons. Sifting through his father’s belongings, Aaron comes upon a mysterious item that is far more than it seems.','https://image.tmdb.org/t/p/w500/3lFQPOhOAg1gAQgFsXdfYfXFbI6.jpg','2019-01-24',5,0),(24870,'Tie Me Up! Tie Me Down!','es','Recently released from a mental hospital, Ricky ties up Marina, a film star he once had sex with and keeps her hostage.','https://image.tmdb.org/t/p/w500/8gwMbLfOazehKF8xxdfYZR18bH3.jpg','1990-01-22',6.9,0),(24871,'The Straight Story','en','A retired farmer and widower in his 70s, Alvin Straight learns one day that his distant brother Lyle has suffered a stroke and may not recover. Alvin is determined to make things right with Lyle while he still can, but his brother lives in Wisconsin, while Alvin is stuck in Iowa with no car and no driver\'s license. Then he hits on the idea of making the trip on his old lawnmower, thus beginning a picturesque and at times deeply spiritual odyssey.','https://image.tmdb.org/t/p/w500/tT9cMiVDdtlcdZxOoFy3VRmEoKk.jpg','1999-10-15',7.7,0),(24872,'The Shop Around the Corner','en','Two employees at a gift shop can barely stand one another, without realising that they are falling in love through the post as each other\'s anonymous pen pal.','https://image.tmdb.org/t/p/w500/dZ1aEzGYRiqJwPfjS6VL7wUkHmF.jpg','1940-01-12',8.3,0),(24873,'Beavis and Butt-Head Do the Universe','en','In 1998, Beavis and Butt-Head are sentenced to Space Camp by a “creative” judge. Their obsession with a docking simulator (huh huh) leads to a trip on the Space Shuttle, with predictably disastrous results. After going through a black hole, they re-emerge in our time, where they look for love, misuse iPhones, and are hunted by the Deep State. Spoiler: They don’t score.','https://image.tmdb.org/t/p/w500/rVKMA2j8m8hWgsDyXOllXp8DsWI.jpg','2022-06-23',7.1,0),(24874,'The Perfect Dictatorship','es','TV MX, the most powerful Mexican Television Corporation, discloses a scandalous story involving Governor Carmelo Vargas in serious crimes and illicit business. Governor Vargas worried about his political future, decides to clean his image and negotiates a billionaire secret agreement with the owners of the TV Corporation. Carlos Rojo, an ambitious young news producer, and Ricardo Diaz, TV network star reporter, are responsible for making a dirty campaign to change the image the public has of the corrupt Governor and make him, at any cost, a political star and a great presidential candidate. Mexican Television believes that democracy is a farce and has already placed one President... Will they do it again?','https://image.tmdb.org/t/p/w500/pjNWekSbafFIPLBNZQ9gUaX3tkV.jpg','2014-10-16',7.3,0),(24875,'Diego Maradona','es','Constructed from over 500 hours of never-before-seen footage, this documentary centers on the personal life and career of the controversial football player Diego Maradona who played for SSC Napoli and Argentina in the 1980s.','https://image.tmdb.org/t/p/w500/3eBZxi0xcXBnEYq4m4YTVf0eHWX.jpg','2019-06-14',7.5,0),(24876,'Do It Like An Hombre','es','Raúl, Eduardo and Santiago have led a happy and \"straight\" life since their childhood, until, one day, Santiago confesses to them that he is gay.','https://image.tmdb.org/t/p/w500/sBGKQRwj21s5dT6FjjU4ostqGaa.jpg','2017-08-11',7.2,0),(24877,'A Most Wanted Man','en','A Chechen Muslim illegally immigrates to Hamburg and becomes a person of interest for a covert government team which tracks the movements of potential terrorists.','https://image.tmdb.org/t/p/w500/6B76Z5Ct758RfKFoFg37skVRiMp.jpg','2014-07-25',6.5,0),(24878,'Go for It','it','After Doug picks up hitchhiking Rosco with his truck, they are mistaken for two bank robbers by the traffic police. They manage to escape  only to be confused for two secret agents while trying to take a flight at the airport.','https://image.tmdb.org/t/p/w500/bYcCMQAz32Ap2AaUZFf4cgpAOoR.jpg','1983-02-01',6.9,0),(24879,'I Origins','en','A molecular biologist\'s study of the human eye has far-reaching implications about humanity\'s scientific and spiritual beliefs.','https://image.tmdb.org/t/p/w500/2P31jhd1dWUAPD8dmnSrwkQ8CNN.jpg','2014-07-18',7.6,0),(24880,'Hurricane','pl','The story of the Polish fliers who found themselves fighting for the freedom of their own country in foreign skies. Seen through the eyes of a Polish fighter ace and adventurer, it tells how the Poles—driven across Europe by the German war machine—finally make their last stand. Flying Hurricanes for the RAF over Britain, they became a key component in the legend of ‘The Few’. Up against the might of the Luftwaffe they hoped that, by saving Great Britain from Nazi invasion, they were keeping the dream of a free Poland alive.','https://image.tmdb.org/t/p/w500/mTpmZORhYswd9YinB23wV9QE2cx.jpg','2018-09-07',5.9,0),(24881,'Love at First Bite','en','Dracula and Renefield relocate to 70\'s era New York in search of Cindy Sondheim, the reincarnation of Dracula\'s one true love, Mina Harker. \"Trouble adjusting\" is a wild understatement for the Count as he battles Cindy\'s psychiatrist, Jeffrey Rosenberg, a descendant of Van Helsing, who may almost certainly, possibly, may be in love with Cindy too.','https://image.tmdb.org/t/p/w500/5quhwEJGiHbRReo1ymO5vfDM6xo.jpg','1979-04-26',6,0),(24882,'Between Worlds','en','Joe—a down-on-his-luck truck driver haunted by the memory of his deceased wife and child—meets Julie, a spiritually gifted woman who enlists his help in a desperate effort to find the lost soul of her comatose daughter. But the spirit of Joe\'s dead wife proves stronger, possessing the young woman\'s body and determined to settle her unfinished business with the living.','https://image.tmdb.org/t/p/w500/7V25KUnWkf0NP7wtGkbmPjEfYf9.jpg','2018-12-21',5.1,0),(24883,'Disconnect: The Wedding Planner','fr','After falling victim to a scam, a desperate man races the clock as he attempts to plan a luxurious destination wedding for an important investor.','https://image.tmdb.org/t/p/w500/co6doQ2d3f5ZaTTvORV76wrTFit.jpg','2023-01-13',5.9,0),(24884,'Nocturne','en','Inside the halls of an elite arts academy, a timid music student begins to outshine her more accomplished and outgoing twin sister when she discovers a mysterious notebook belonging to a recently deceased classmate.','https://image.tmdb.org/t/p/w500/zJNFiWBGYSMbfTAk6Ygqdj6Rahq.jpg','2020-10-13',5.9,0),(24885,'The Best of Enemies','en','Centers on the unlikely relationship between Ann Atwater, an outspoken civil rights activist, and C.P. Ellis, a local Ku Klux Klan leader who reluctantly co-chaired a community summit, battling over the desegregation of schools in Durham, North Carolina during the racially-charged summer of 1971. The incredible events that unfolded would change Durham and the lives of Atwater and Ellis forever.','https://image.tmdb.org/t/p/w500/4pA9318BY7CSnXVi3xKBtPYMe1T.jpg','2019-04-05',7.4,0),(24886,'Johnny Mnemonic','en','In a dystopian 2021, Johnny is a data trafficker who has an implant that allows him to securely store data too sensitive for regular computer networks. On one delivery run, he accepts a package that not only exceeds the implant\'s safety limits—and will kill him if the data is not removed in time—but also contains information far more important and valuable than he had ever imagined. On a race against time, he must avoid the assassins sent to kill him and remove the data before it, too, ends his life.','https://image.tmdb.org/t/p/w500/iH8Jgi8qvb7pnBfI8fVGaUbyRna.jpg','1995-05-26',5.7,0),(24887,'The Whole Nine Yards','en','After a mobster agrees to cooperate with an FBI investigation in order to stay out of prison, he\'s relocated by the authorities to a life of suburban anonymity as part of a witness protection program. It\'s not long before a couple of his new neighbours figure out his true identity and come knocking to see if he\'d be up for one more hit—suburban style.','https://image.tmdb.org/t/p/w500/r4FvRHW1J9FAOnCYchZ7QanQ04e.jpg','2000-02-18',6.4,0),(24888,'Still Alice','en','Alice Howland, happily married with three grown children, is a renowned linguistics professor who starts to forget words. When she receives a devastating diagnosis, Alice and her family find their bonds tested.','https://image.tmdb.org/t/p/w500/yY6ypZPQl67J4RwOA6YBALNS3Wj.jpg','2014-12-05',7.5,0),(24889,'The Dry','en','Aaron Falk returns to his drought-stricken hometown to attend a tragic funeral. But his return opens a decades-old wound - the unsolved death of a teenage girl.','https://image.tmdb.org/t/p/w500/zM12bfL2TEqVRXjiQIFUWUMLcCg.jpg','2020-12-11',6.8,0),(24890,'Flying Swords of Dragon Gate','zh','Flying Swords of Dragon Gate picks up three years after the infamous Dragon Inn was burnt down in the desert when its innkeeper Jade vanished. A new gang of marauders had taken over - innkeepers by day and treasure hunters by night. The inn is the rumoured location of a lost city buried under the desert, and its hidden treasure would only be revealed by a gigantic storm every 60 years. The gang used the inn as a front to locate the lost treasure.','https://image.tmdb.org/t/p/w500/1i5kkGZne5tKfSlTtaYnfJQNN6c.jpg','2011-12-15',6.2,0),(24891,'Dressed to Kill','en','After witnessing a mysterious woman brutally slay a homemaker, prostitute Liz Blake finds herself trapped in a dangerous situation. While the police thinks she is the murderer, the real killer is intent on silencing her only witness.','https://image.tmdb.org/t/p/w500/oy1m5dd44foNrxV8U9l6Walx82V.jpg','1980-07-25',6.9,0),(24892,'Worth','en','Kenneth Feinberg, a powerful D.C. lawyer appointed Special Master of the 9/11 Fund, fights off the cynicism, bureaucracy, and politics associated with administering government funds and, in doing so, discovers what life is worth.','https://image.tmdb.org/t/p/w500/xMFKTgRRCxfZGmFQVxBsQYAQufo.jpg','2021-07-21',6.8,0),(24893,'My Salinger Year','en','A college grad takes a clerical job working for the literary agent of the renowned, reclusive writer J.D. Salinger.','https://image.tmdb.org/t/p/w500/dC4IBKaCLFwnQlGmsYT8mr0Sp4n.jpg','2021-01-14',6.3,0),(24894,'Poison Ivy 2: Lily','en','A young and naive college art student becomes obsessed with assuming the identity and 