d from her in the personals section of the newspaper. This fascination reaches a peak when an ad with the headline \"Desperately Seeking Susan\" proposes a rendezvous. Roberta goes too, and in a series of events involving amnesia and mistaken identity, steps into Susan\'s life.','https://image.tmdb.org/t/p/w500/ighImRgzYzZ88skBHaT4B7ntJG8.jpg','1985-03-29',6.1,0),(24900,'Mara','en','Criminal psychologist Kate Fuller is assigned to the murder of a man who has seemingly been strangled in his sleep by his wife and the only witness is their eight-year-old daughter, Sophie. As Kate digs into the mystery of an ancient demon which kills people in their sleep, she experiences the same petrifying symptoms as all previous victims and spirals through a chilling nightmare to save herself and Sophie before she dares fall asleep again.','https://image.tmdb.org/t/p/w500/gQDmXAef1Oc1SXci5mui2x5DJwt.jpg','2018-08-22',5.7,0),(24901,'Cool Kids Don\'t Cry','nl','Adaptation of one of Benelux most famous children\'s novels. Tough prime school girl Akkie loves soccer and can be a real bully. Love is the only thing she\'s scared of. When Akkie is diagnosed with Leukemia, she has to fight for her life. On the verge of going to high school, Akkie has to allow love to enter her life, and thus gain courage to accept the inevitable.','https://image.tmdb.org/t/p/w500/Sjra8pU6vfnfEfy73MZdogfn5P.jpg','2012-02-15',8,0),(24902,'Let the Right One In','sv','Set in 1982 in the suburb of Blackeberg, Stockholm, twelve-year-old Oskar is a lonely outsider, bullied at school by his classmates; at home, Oskar dreams of revenge against a trio of bullies. He befriends his twelve-year-old, next-door neighbor Eli, who only appears at night in the snow-covered playground outside their building.','https://image.tmdb.org/t/p/w500/4hezTKTuZMp0l2ufihKwPgLmfLg.jpg','2008-10-24',7.5,0),(24903,'The Hunter','en','Martin, a mercenary, is sent from Europe by an anonymous biotech company to the Tasmanian wilderness on a hunt for the last Tasmanian tiger.','https://image.tmdb.org/t/p/w500/KgFYNh3GE36FrXjo9udZbnV1z6.jpg','2011-10-06',6.6,0),(24904,'Babe: Pig in the City','en','Babe, fresh from his victory in the sheepherding contest, returns to Farmer Hoggett\'s farm, but after Farmer Hoggett is injured and unable to work, Babe has to go to the big city to save the farm.','https://image.tmdb.org/t/p/w500/glO6LcTWUZcbxWT2SB4eRDnFSsP.jpg','1998-11-25',5.6,0),(24905,'The French Connection','en','Tough narcotics detective \'Popeye\' Doyle is in hot pursuit of a suave French drug dealer who may be the key to a huge heroin-smuggling operation.','https://image.tmdb.org/t/p/w500/5XSGvIKl2yPvOkieFjc3rzLw7x0.jpg','1971-10-09',7.5,0),(24906,'Rampage: Capital Punishment','en','A man takes over a TV station and holds a number of hostages as a political platform to awaken humanity, instead of money.','https://image.tmdb.org/t/p/w500/6CFQrSUUss1rnFqSpzLf4tx2TDo.jpg','2014-07-19',6,0),(24907,'Hombre','en','John Russell, disdained by his \"respectable\" fellow stagecoach passengers because he was raised by Indians, becomes their only hope for survival when they are set upon by outlaws.','https://image.tmdb.org/t/p/w500/puqgDLxdIZSnodDJ6Q0KxofOebo.jpg','1967-03-21',7.1,0),(24908,'A Lot Like Love','en','On a flight from Los Angeles to New York, Oliver and Emily make a connection, only to decide that they are poorly suited to be together. Over the next seven years, however, they are reunited time and time again, they go from being acquaintances to close friends to ... lovers?','https://image.tmdb.org/t/p/w500/6xrF9zwEbYiYBOalMO14RAWBLLj.jpg','2005-04-21',6.8,0),(24909,'Home of the Brave','en','The day after they get the word they\'ll go home in two weeks, a group of soldiers from Spokane are ambushed in an Iraqi city. Back stateside we follow four of them - a surgeon who saw too much, a teacher who\'s a single mom and who lost a hand in the ambush, an infantry man whose best friend died that day, and a soldier who keeps reliving the moment he killed a civilian woman.','https://image.tmdb.org/t/p/w500/eQokFEJYba9PUhJ99W0TsxzOynp.jpg','2006-12-15',5.5,0),(24910,'Message from the King','en','On a relentless quest to avenge his sister\'s murder, a man from Cape Town infiltrates a sprawling network of lowlifes and elites in Los Angeles.','https://image.tmdb.org/t/p/w500/oke6xdVV3QNRFBZSw4Wj6oKGmT5.jpg','2017-05-10',6.2,0),(24911,'It\'s Christmastime Again, Charlie Brown','en','As the holiday season rolls around and all the Peanuts gang are getting ready for it. Whether it be Charlie Brown struggling to raise money for his girlfriend or Sally and Peppermint Patty struggling to rehearse and memorize their one word lines for the Christmas pageant, these kids try to keep with the Christmas spirit while Snoopy has his mischief to do.','https://image.tmdb.org/t/p/w500/cgS0NsSVOgNtauOYooS4KzLd6oZ.jpg','1992-11-27',6.2,0),(24912,'A Boy and His Dog','en','Set in the year 2024 in post-apocalyptic America, 18-year old Vic and his telepathic dog, Blood, are scavengers in the desolate wilderness ravaged by World War IV, where survivors must battle for food and shelter in the desert-like wasteland. Vic and Blood eke out a meager existence, foraging for food and fighting gangs of cutthroats.','https://image.tmdb.org/t/p/w500/dMbkoFzD5sEQvEaqRsIh4pTBJVq.jpg','1975-03-23',6.3,0),(24913,'The Dallas Connection','en','Assassins led by Black Widow are out to kill Antonio Morales to prevent him from handing a computer chip over to IWAR headquarters. It\'s up to secret agents Chris Cannon, Mark Austin, and Samantha Maxx to stop them','https://image.tmdb.org/t/p/w500/yHrd3gMBi5VgZZEpxixtQpbNZEh.jpg','1994-10-02',4.7,0),(24914,'Curve','en','Clinging to a smooth, curved surface high above a sentient abyss, a girl tries to cover the few feet back to safety without losing purchase and falling to her death.','https://image.tmdb.org/t/p/w500/ehQdA0835DFN6Jsv7uUWcDEJZMx.jpg','2016-04-16',7.4,0),(24915,'The Looney, Looney, Looney Bugs Bunny Movie','en','Bugs Bunny hosts an award show featuring several classic Looney Tunes shorts and characters. This movie was released in 1981 by Warner Bros. and was produced by Friz Freleng. New footage was one of the final productions done by DePatie-Freleng Enterprises (also known as Marvel Productions beginning in the 1980s) and the film was re-released in the USA on April 28, 2009 from Warner Home Video.','https://image.tmdb.org/t/p/w500/k4qMlWQ420zkUBIHrUkcwmAasxH.jpg','1981-11-20',7.2,0),(24916,'Fright Night','en','A teenager suspects his new neighbour is a vampire. Unable to convince anyone, he tries to enlist the help of a self-proclaimed vampire hunter and magician.','https://image.tmdb.org/t/p/w500/ySQ3v4Fzpy3fePs86eoLiDzwLYM.jpg','2011-08-18',6.2,0),(24917,'The People vs. Larry Flynt','en','Larry Flynt is the hedonistically obnoxious, but indomitable, publisher of Hustler magazine. The film recounts his struggle to make an honest living publishing his girlie magazine and how it changes into a battle to protect the freedom of speech for all people.','https://image.tmdb.org/t/p/w500/sAgHn7ys6TiVXBDTZ0UBEjinIUk.jpg','1996-12-25',7,0),(24918,'The Thomas Crown Affair','en','A very rich and successful playboy amuses himself by stealing artwork, but may have met his match in a seductive detective.','https://image.tmdb.org/t/p/w500/5yqs1MVlqdIg1DY5adC5jFx3d7j.jpg','1999-08-06',6.7,0),(24919,'Battle at Big Rock','en','A family\'s camping trip at Big Rock National Park becomes a terrifying fight for survival.','https://image.tmdb.org/t/p/w500/llnKykkow6C5viJsTeHfUTMQptI.jpg','2019-09-15',7,0),(24920,'Flight Crew','ru','A story about bravery, self-sacrifice and human dignity put on trial by the merciless power of nature. A young pilot is fired from military air force after disobeying an absurd order. He gets a job as a co-pilot with a civil airline. Being brutally honest and direct, he is not on best terms with his new colleagues. During a flight to Asia his crew receives a distress message from a volcanic island and makes a decision to attempt a rescue mission. Will it be a success? Will they survive the disaster? They have a single chance to find that out: by being a team and sticking up for one another.','https://image.tmdb.org/t/p/w500/nL1WhzLiD2nZ7ixQcp5K0z4eEB7.jpg','2016-04-21',6.9,0),(24921,'K-9: P.I.','en','Dooley and his K-9 partner Jerry Lee are ready to retire from the police force. But before he can retire with his pension he must work as a P.I. to find a set of high tech computer chips.','https://image.tmdb.org/t/p/w500/lkI06uQJCnujYoN6MJzjnsxryaI.jpg','2002-07-30',5.8,0),(24922,'Crypto','en','A young agent is tasked with investigating a tangled web of corruption and fraud in New York.','https://image.tmdb.org/t/p/w500/fzTvnA3buXsjdmjrYRDozKBFF78.jpg','2019-04-12',5.5,0),(24923,'Akeelah and the Bee','en','Akeelah is a precocious 11-year-old girl from south Los Angeles with a gift for words. Despite her mother\'s objections, Akeelah enters various spelling contests, for which she is tutored by the forthright Dr. Larabee, her principal Mr. Welch, and the proud residents of her neighborhood. Akeelah\'s aptitude earns her an opportunity to compete for a spot in the Scripps National Spelling Bee.','https://image.tmdb.org/t/p/w500/oyIAupl1jqjuVVFXYtfoUgNsDdE.jpg','2006-04-28',7,0),(24924,'Puff: Wonders of the Reef','en','A baby pufferfish travels through a wondrous microworld full of fantastical creatures as he searches for a home on the Great Barrier Reef.','https://image.tmdb.org/t/p/w500/3jW7VXaI955lIfegDlB0F5OShbP.jpg','2021-10-01',7.7,0),(24925,'Raising Arizona','en','When a childless couple of an ex-con and an ex-cop decide to help themselves to one of another family\'s quintuplets, their lives become more complicated than they anticipated.','https://image.tmdb.org/t/p/w500/m5Zp4K4hKdPhsBl3E0p8I7QomlT.jpg','1987-03-01',7,0),(24926,'Destroyer','en','When Erin Bell was a young cop, she was given an undercover assignment that ended badly and destroyed her life. Years later, she must face her demons in order to make peace with her past.','https://image.tmdb.org/t/p/w500/sHw9gTdo43nJL82py0oaROkXXNr.jpg','2018-12-25',5.9,0),(24927,'Girl vs. Monster','en','Skylar finds out that her parents are monster hunters after she accidentally releases some monsters from a secret containment chamber; so she and her techno friends must recapture all the monsters and also save her mom and dad from these monsters who are out for revenge.','https://image.tmdb.org/t/p/w500/loYCEzuOt70tTgd1JhBfIfIBbHb.jpg','2012-10-12',6.3,0),(24928,'Beau Travail','fr','Foreign Legion officer Galoup recalls his once glorious life, training troops in the Gulf of Djibouti. His existence there was happy, strict and regimented, until the arrival of a promising young recruit, Sentain, plants the seeds of jealousy in Galoup\'s mind.','https://image.tmdb.org/t/p/w500/gR8z07v2Y1gwAbmLnrJyZWxCHxs.jpg','1999-09-16',7,0),(24929,'Trespass','en','Two Arkansas firemen, Vince and Don, get hold of a map that leads to a cache of stolen gold in an abandoned factory in East St. Louis. What they don\'t know is that the factory is in the turf of a local gang, who come by to execute one of their enemies. Vince sees the shooting, the gang spots Vince, and extended mayhem ensues. As Vince and Don try to escape, gang leader King James argues with his subordinate Savon about how to get rid of the trespassers.','https://image.tmdb.org/t/p/w500/GSeicpK571uoM2ZCRb1YyW2YMG.jpg','1992-12-25',6.2,0),(24930,'Nicky Larson and the Cupid\'s Perfume','fr','Nicky Larson is tasked to recover the perfume of Cupid, a perfume that would make anyone who uses it irresistible.','https://image.tmdb.org/t/p/w500/rrwejDUmCSaca2Afubznkdp3ogB.jpg','2019-02-06',6.5,0),(24931,'Lords of Chaos','en','A teenager\'s quest to launch Norwegian Black Metal in Oslo in the 1990s results in a very violent outcome.','https://image.tmdb.org/t/p/w500/y2eOIfQw2lLZov6aJZ3xpPjnRHH.jpg','2018-09-20',6.8,0),(24932,'God Forgives... I Don\'t!','it','In this violent spaghetti western a murderous robber hijacks a payroll train, murders everyone aboard and then stashes his loot. A gunslinger learns about it and decides he wants the money for himself and so hatches an elaborate plot to get at it. He lures the crook into a rigged poker game, and afterward a gunfight ensues. The quick-drawing gunman makes short work of the robber, then teams up with an insurance agent to look for the hidden fortune. Unbeknownst to them, the robber had an ace up his sleeve...','https://image.tmdb.org/t/p/w500/mEhoHmnwxpGeLdSOfqJHFGmcWqv.jpg','1967-10-31',6.6,0),(24933,'Moloch','nl','Betriek lives at the edge of a peat bog in the North of the Netherlands. When she and her family are attacked by a random stranger one night, Betriek sets out to find an explanation. The more she digs, the more she becomes convinced that she is being hunted by something ancient.','https://image.tmdb.org/t/p/w500/3jVzYOnylmvo7ZnGerjfoRj2wFz.jpg','2022-05-19',6,0),(24934,'If Only','en','After his impetuous musician girlfriend, Samantha, dies in an accident shortly after they had a fight (and nearly broke up), a grief-stricken British businessman, Ian Wyndham, living in London gets a chance to relive the day all over again, in the hope of changing the events that led up to her getting killed.','https://image.tmdb.org/t/p/w500/ameKWdTOYKzz24af3cU6I6aE6g.jpg','2004-01-23',7,0),(24935,'Batman: The Doom That Came to Gotham','en','Explorer Bruce Wayne accidentally unleashes an ancient evil, and returns to Gotham after being away for two decades. There, Batman battles Lovecraftian supernatural forces and encounters allies and enemies such as Green Arrow, Ra\'s al Ghul, Mr. Freeze, Killer Croc, Two-Face and James Gordon.','https://image.tmdb.org/t/p/w500/v0Jsn4jSN4yUBbKoVNCU7Zuzl1U.jpg','2023-03-28',0,0),(24936,'Journey to the West: The Demons Strike Back','zh','Tang Monk brings three disciples on a journey to the West. On the outside, everything seems harmonious. However, tension is present beneath the surface, and their hearts and minds are not in agreement. After a series of demon-capturing events, the monk and his disciples gain mutual understanding of each others\' hardships and unease. Finally, they resolve their inner conflict and work together to become an all-conquering, demon-exorcising team.','https://image.tmdb.org/t/p/w500/aBwcH7Wb1j14s2YsNeKkOIAUBuw.jpg','2017-01-28',6,0),(24937,'Devil\'s Knot','en','The savage murders of three young children sparks a controversial trial of three teenagers accused of killing the kids as part of a satanic ritual.','https://image.tmdb.org/t/p/w500/8DMDx7XMylIL7lpBEOMzIjuwhw0.jpg','2013-05-09',6.1,0),(24938,'Solaris','en','A troubled psychologist is sent to investigate the crew of an isolated research station orbiting a bizarre planet.','https://image.tmdb.org/t/p/w500/drdrB1hEZmzFlK1xtW5HMxK3LUJ.jpg','2002-11-27',5.9,0),(24939,'Thank You for Your Service','en','A group of U.S. soldiers returning from Iraq struggle to integrate back into family and civilian life, while living with the memory of a war that threatens to destroy them long after they\'ve left the battlefield.','https://image.tmdb.org/t/p/w500/z8OKWw6DAZAOyz8F421euawr3Hs.jpg','2017-10-26',6.5,0),(24940,'Chances Are','en','Louie Jeffries is happily married to Corinne. On their first anniversary, Louie is killed crossing the road. Louie is reincarnated as Alex Finch, and twenty years later, fate brings Alex and Louie\'s daughter, Miranda, together. It\'s not until Alex is invited to Louie\'s home that he begins to remember his former life, wife and best friend. Of course, there\'s also the problem that he\'s attracted to Louie\'s/his own daughter.','https://image.tmdb.org/t/p/w500/8pnUGbQSXuYCffRCtkFaVA5SuVY.jpg','1989-03-10',6.7,0),(24941,'The Broken Hearts Gallery','en','Lucy is a young gallery assistant who collects mementos from her relationships. She discovers that she must let go of her past to move forward, and comes up with a lovely, artistic way to help herself and others who have suffered heartbreak.','https://image.tmdb.org/t/p/w500/wGkr4r1e8nubmSNKJpv3HL6sFrA.jpg','2020-09-11',7.2,0),(24942,'The Remains of the Day','en','A rule bound head butler\'s world of manners and decorum in the household he maintains is tested by the arrival of a housekeeper who falls in love with him in post-WWI Britain. The possibility of romance and his master\'s cultivation of ties with the Nazi cause challenge his carefully maintained veneer of servitude.','https://image.tmdb.org/t/p/w500/qtwipjmSypSQuSvz5BNirSxZqbg.jpg','1993-11-05',7.4,0),(24943,'Непослушная','ru','Twenty-year-old Elya is a student and a future ecologist. One day, Matvey, the head of a construction company, comes to her university to talk about a development plan on the site of an old forest park. Elya does not hesitate to smash his project to smithereens. Matvey is intrigued by the girl\'s self-confidence and uses his usual methods of influence - he simply tries to \"buy\" her. But Elya doesn\'t need a sponsor. Then Matvey, surprised by her impregnability, offers Elya a bet: seven romantic days according to his rules. If after that the girl still decides to leave, he will refuse to build a skyscraper in the forest park. She agrees when Matvey really suspends the design work. Elya sees herself as something like the heroine of the film Pretty Woman, but Matvey turns out to be not at all the person she imagined.','https://image.tmdb.org/t/p/w500/uDYCQ8mPekP1B3wUFSaaOFkNWVB.jpg','2023-02-14',0,0),(24944,'Hiroshima Mon Amour','fr','The deep conversation between a Japanese architect and a French actress forms the basis of this celebrated French film, considered one of the vanguard productions of the French New Wave. Set in Hiroshima after the end of World War II, the couple -- lovers turned friends -- recount, over many hours, previous romances and life experiences. The two intertwine their stories about the past with pondering the devastation wrought by the atomic bomb dropped on the city.','https://image.tmdb.org/t/p/w500/r7tRzA1efEIkYNBEhWqowECOHf9.jpg','1959-06-10',7.8,0),(24945,'Stranger by the Lake','fr','Summertime. A cruising spot for men, tucked away on the shores of a lake. Franck falls in love with Michel, an attractive, potent and lethally dangerous man. Franck knows this but wants to live out his passion anyway.','https://image.tmdb.org/t/p/w500/zXfcNpUkF44dDoMjE4CTelJPW8P.jpg','2013-06-12',6.3,0),(24946,'The Towering Inferno','en','At the opening party of a colossal—but poorly constructed—skyscraper, a massive fire breaks out, threatening to destroy the tower and everyone in it.','https://image.tmdb.org/t/p/w500/mFM1GbrRrT3DWUFFo8koSITFnYe.jpg','1974-12-14',7,0),(24947,'Krull','en','A prince and a fellowship of companions set out to rescue his bride from a fortress of alien invaders who have arrived on their home planet.','https://image.tmdb.org/t/p/w500/b1anwwbh00R3iOgM88L5jf7qHBt.jpg','1983-07-29',6.1,0),(24948,'Restraint','en','Two fugitives land in hot water when they take a hostage who poses a threat to their well-being.','https://image.tmdb.org/t/p/w500/2bguGmptNflshQgBdDimIlt028b.jpg','2008-08-19',6,0),(24949,'The Boss Baby: Get That Baby!','en','Think you\'ve got what it takes to be the boss? This interactive special puts your skills to the test and matches you up with one of 16 jobs at Baby Corp.','https://image.tmdb.org/t/p/w500/epvUyxGpiaacwojju2CMa0I3Y6T.jpg','2020-09-01',6.5,0),(24950,'Just Married','en','Tom Leezak and Sarah McNerney fall in love and plan to get married, despite opposition from Sarah\'s uptight, rich family. When they do get married, and get a chance to prove Sarah\'s family wrong, they go on a European honeymoon and run into disaster after disaster. They have to decide whether the honeymoon from hell and a few pre-marital mistakes are worth throwing away their love and marriage.','https://image.tmdb.org/t/p/w500/dWGEGhyl7T5prK8o18IUTSafxjv.jpg','2003-01-08',5.7,0),(24951,'Robert Reborn','en','In 1951 USSR, as the Cold War intensifies, infamous dictator Joseph Stalin is suffering with illness and his death is imminent. Meanwhile, KGB agent Stoichkov discovers a mysterious stage show in the Baltic region featuring three creepy dolls - Robert, Kalashnikov and Miss Cyclops. Spellbound by the lifelike animation displayed by the dolls on stage, Stoichkov investigates the show\'s host and discovers he is a German Toymaker who owns a mystical book which holds the key to eternal life. Believing the Toymaker and his book will help Stalin escape death, Stoichkov kidnaps him and they board a plane to Moscow. But the Toymaker\'s living creations have followed them. When the plane is in mid air all hell breaks loose as Stoichkov and his team of KGB agents realize the three dolls are on board and will stop at nothing to rescue their puppet master. Fasten your seat belt and prepare for blood soaked toy terror at 30,000 feet.','https://image.tmdb.org/t/p/w500/f8V2qB4ehyGCEMBsLPXDNiTvcx7.jpg','2019-06-04',4,0),(24952,'Higher Learning','en','Malik is an African-American student attending on a track scholarship; academics are not his strong suit, and he goes in thinking that his athletic abilities will earn him a free ride through college. Fudge, a \"professional student\" who has been at Columbus for six years so far, becomes friendly with Malik and challenges his views about race and politics in America.','https://image.tmdb.org/t/p/w500/anLJOkvjwY31NiRoEuZ23yBAZEK.jpg','1995-01-11',6.4,0),(24953,'The Sweetest Thing','en','Christina\'s love life is stuck in neutral. After years of avoiding the hazards of a meaningful relationship, one night while club-hopping with her girlfriends, she meets Peter, her perfect match. Fed up with playing games, she finally gets the courage to let her guard down and follow her heart, only to discover that Peter has suddenly left town. Accompanied by Courtney, she sets out to capture the one that got away.','https://image.tmdb.org/t/p/w500/qLysz4B5YmiDq52Op0zq4eD75LC.jpg','2002-04-12',5.5,0),(24954,'Saturn 3','en','In the future, Earth is overcrowded and the population relies on distant bases to be fed. In the Saturn 3 station, Major Adam and the scientist Alex, who is also his lover and has never been on Earth, have been researching hydroponics for three years in the base alone with their dog Sally.  Captain Benson arrives Saturn 3 with Hector, incapable to controlling his emotions he transfers his homicidal tendency and insanity to Hector.  Now Major Adam and Alex are trapped in the station with a dangerous psychopath robot.','https://image.tmdb.org/t/p/w500/zAoLR1azwd8QbglnjWpOwJ4PI6C.jpg','1980-02-15',5.4,0),(24955,'Wayne\'s World 2','en','A message from Jim Morrison in a dream prompts cable access TV stars Wayne and Garth to put on a rock concert, \"Waynestock,\" with Aerosmith as headliners. But amid the preparations, Wayne frets that a record producer is putting the moves on his girlfriend, Cassandra, while Garth handles the advances of mega-babe Honey Hornee.','https://image.tmdb.org/t/p/w500/xRzMaHvSJEBdqEVrscOnfyyCj2Y.jpg','1993-12-10',6.1,0),(24956,'El último hombre sobre la Tierra','es','Liliana is the dream girl of many of her co-workers, among them \"Piquiña\", an ugly and ordinary charlatan who, convinced of his irresistible attractiveness, launches into her conquest during the celebration of the company\'s \"novena\". Liliana, who can\'t stand \"Piquíña\", makes it clear to him that the only way she would be with him would be if he were the last man on earth.','https://image.tmdb.org/t/p/w500/4zWxQ0hymf6S2wQfj0lY8rfgvjZ.jpg','2022-12-22',2,0),(24957,'Deep End','en','London, England. Mike, a fifteen-year-old boy, gets a job in a bathhouse, where he meets Susan, an attractive young woman who works there as an attendant.','https://image.tmdb.org/t/p/w500/8pZxUJTgjerjxuifSU13B8pXAJB.jpg','1970-09-01',6.9,0),(24958,'Great Expectations','en','Loosely based on the Charles Dickens\' classic novel, \"Great Expectations\" is a sensual tale of a young man\'s unforgettable passage into manhood, and the three individuals who will undeniably change his life forever. Through the surprising interactions of these vivid characters, \"Great Expectations\" takes a unique and contemporary look at life\'s great coincidences.','https://image.tmdb.org/t/p/w500/gaYBDBEldgpTwWIXaqt9HlB4YH0.jpg','1998-01-30',6.6,0),(24959,'Ghost House','en','A young couple go on an adventurous vacation to Thailand only to find themselves haunted by a malevolent spirit after naively disrespecting a Ghost House.','https://image.tmdb.org/t/p/w500/gTnxcpzZYcqFVsAXdPwSOs5bjgg.jpg','2017-07-21',5.7,0),(24960,'Heart of Dragon','cn','A policeman forsakes his dream of world travel to care for a mentally impaired brother, who is later kidnapped by gangsters.','https://image.tmdb.org/t/p/w500/jT2WPtDlMUMm9h5HoDN1x2zDQ22.jpg','1985-09-14',6.8,0),(24961,'Peeping Tom','en','Loner Mark Lewis works at a film studio during the day and, at night, takes racy photographs of women. Also he\'s making a documentary on fear, which involves recording the reactions of victims as he murders them. He befriends Helen, the daughter of the family living in the apartment below his, and he tells her vaguely about the movie he is making.','https://image.tmdb.org/t/p/w500/gVoaduL8ievTlJ4Rm0DrVYTn3zC.jpg','1960-05-16',7.5,0),(24962,'Welcome to the Sticks','fr','Although living a comfortable life in Salon-de-Provence, a charming town in the South of France, Julie has been feeling depressed for a while. To please her, Philippe Abrams, a post office administrator, her husband, tries to obtain a transfer to a seaside town, on the French Riviera, at any cost. The trouble is that he is caught red-handed while trying to scam an inspector. Philippe is immediately banished to the distant unheard of town of Bergues, in the Far North of France...','https://image.tmdb.org/t/p/w500/cnUkc60SkI1PCY1SyfLFpZc0T7C.jpg','2008-02-20',6.7,0),(24963,'Ted Bundy','en','Docu-drama based on the life of Ted Bundy, a serial killer who killed at least 19 young women during the 1970\'s (though some sources say as many as 30 to 35 were murdered). Set from his college student years, to his first victims, his capture, escape from prison (twice), his final killing spree to his trial, conviction and execution.','https://image.tmdb.org/t/p/w500/bh6wHjHxmuSyYL8jSFqtLlzMSGq.jpg','2002-11-22',5.8,0),(24964,'Remo Williams: The Adventure Begins','en','An officially \"dead\" cop is trained to become an extraordinary unique assassin in service of the U.S. President.','https://image.tmdb.org/t/p/w500/xTSrGyfmr3xbnnlT9d1SVYC4gtt.jpg','1985-10-11',6.3,0),(24965,'Venus in Fur','fr','An enigmatic actress may have a hidden agenda when she auditions for a part in a misogynistic writer\'s play.','https://image.tmdb.org/t/p/w500/b9pCYixO3ZO7tB303efB3O4nkqC.jpg','2013-05-28',7.3,0),(24966,'Whatever Works','en','Whatever Works explores the relationship between a crotchety misanthrope, Boris and a naïve, impressionable young runaway from the south, Melody. When Melody\'s uptight parents arrive in New York to rescue her, they are quickly drawn into wildly unexpected romantic entanglements. Everyone discovers that finding love is just a combination of lucky chance and appreciating the value of \"whatever works.\"','https://image.tmdb.org/t/p/w500/tLqMTpxtDEOXIHR4pY8fvvQg6dW.jpg','2009-06-19',7.1,0),(24967,'Defiance','en','Based on a true story, during World War II, four Jewish brothers escape their Nazi-occupied homeland of West Belarus in Poland and join the Soviet partisans to combat the Nazis. The brothers begin the rescue of roughly 1,200 Jews still trapped in the ghettos of Poland.','https://image.tmdb.org/t/p/w500/b1xn65gjQmFbnxuR4ZzoMKWRsJk.jpg','2008-12-31',6.8,0),(24968,'A Chinese Odyssey Part One: Pandora\'s Box','cn','When the Goddess of Happiness tosses the Longevity Monk and his disciples out of heaven (because the Monkey King tried to attain immortality), the Monkey King is reincarnated as the Joker. He now spends his time chasing two jealous women. When one of them is dying, the Joker goes back in time in an attempt to save her.','https://image.tmdb.org/t/p/w500/p2TnX8MwCM6GUjcX0R6s3wDb9En.jpg','1995-01-21',7.4,0),(24969,'Read It and Weep','en','A young girl turns into an A-List celebrity over night when her private journal is accidently published and becomes a best-seller.','https://image.tmdb.org/t/p/w500/dyGWW7ch4GWPgdcShBnT7jnQ1uW.jpg','2006-07-21',5.8,0),(24970,'Camera Buff','pl','Filip buys an 8mm movie camera when his first child is born. Because it\'s the first camera in town, he\'s named official photographer by the local Party boss. His horizons widen when he is sent to regional film festivals with his first works but his focus on movie making also leads to domestic strife and philosophical dilemmas.','https://image.tmdb.org/t/p/w500/l4n9LXUanIKdlKTCfRqrhwQbtVe.jpg','1979-11-16',7.5,0),(24971,'The Chipmunk Adventure','en','The Chipmunks and the Chipettes go head to head in a hot air balloon race, and the winner gets $10,000. Unbeknownst to the participants, the \"race\" is actually a diamond smuggling ring!','https://image.tmdb.org/t/p/w500/o0d8qJL8anmGG14UfjBC7HHATJK.jpg','1987-05-22',6.9,0),(24972,'Road Trip: Beer Pong','en','It’s Road Trip - Beer Pong! Three college roommates are on the ride of their lives when they drop everything to join a bus full of sexy, scantily clad models to compete in the ultimate sport competition: the National Beer Pong Tournament.','https://image.tmdb.org/t/p/w500/4lByVZkyTZziMCXdPZf6zkOJDN6.jpg','2009-08-11',5.5,0),(24973,'Raising Helen','en','Helen Harris has a glamorous, big-city life working for one of New York\'s hottest modeling agencies. But suddenly her free-spirited life gets turned upside down when she must chose between the life she\'s always loved, and the new loves of her life!','https://image.tmdb.org/t/p/w500/ubZin4oGXYp6hCn3WU6nrBre62y.jpg','2004-05-27',6.1,0),(24974,'Frailty','en','A man confesses to an FBI agent his family\'s story of how his religious fanatic father\'s visions lead to a series of murders to destroy supposed \'demons\'.','https://image.tmdb.org/t/p/w500/hER3sVCZ9cZRBO0KNI7NbtiLacn.jpg','2001-11-17',7,0),(24975,'When Father Was Away on Business','sh','Tito\'s break-up with Stalin in 1948 marked the beginning of not only confusing, but also very dangerous years for many hard-core Yugoslav communists. A careless remark about the newspaper cartoon is enough for Mesha to join many arrested unfortunates. His family is now forced to cope with the situation and wait for his release from prison.','https://image.tmdb.org/t/p/w500/jhTu6UwP32jPwiBccGAkZq0yqvV.jpg','1985-01-15',7.3,0),(24976,'Cube 2: Hypercube','en','The sequel to the low budget first film Cube. This time the prisoners find them selves in a more advanced cube environment that they must escape from before they are killed. A science fiction film where space and time have more than one path.','https://image.tmdb.org/t/p/w500/bEqqwtwUP7lm56VyeVONhv9JtYu.jpg','2002-04-15',5.5,0),(24977,'Monster','en','The story of Steve Harmon, a 17-year-old honor student whose world comes crashing down around him when he is charged with felony murder.','https://image.tmdb.org/t/p/w500/jds6n8dUaixg0diKYlCta5nS6BV.jpg','2021-07-15',6.6,0),(24978,'The Fast and the Furious','en','Dominic Toretto is a Los Angeles street racer suspected of masterminding a series of big-rig hijackings. When undercover cop Brian O\'Conner infiltrates Toretto\'s iconoclastic crew, he falls for Toretto\'s sister and must choose a side: the gang or the LAPD.','https://image.tmdb.org/t/p/w500/lgCEntS9mHagxdL5hb3qaV49YTd.jpg','2001-06-22',6.9,0),(24979,'Manou the Swift','en','The little swift Manou grows up believing he\'s 