db.org/t/p/w500/9BXAC4uTHuD37hpiGOmhetqNgnO.jpg','2002-10-11',6.6,0),(24985,'Long Weekend','en','Bart\'s chance encounter with the enigmatic Vienna leads to a whirlwind weekend together. The two fall fast and hard, but both carry secrets that could be their undoing or the chance for a fresh start.','https://image.tmdb.org/t/p/w500/OyKfblQX6SR2rL6R26g5eYCLHq.jpg','2021-03-12',7.6,0),(24986,'The Last Frontier','ru','The story of the Podolsk cadets’ heroic stand outside Moscow in October 1941. Cadets were sent to the Ilyinsky line, fighting alongside units from the Soviet 43rd Army to hold back the German advance until reinforcements arrived. Hopelessly outnumbered, young men laid down their lives in a battle lasting almost two weeks to obstruct the far superior German forces advancing towards Moscow. Around 3,500 cadets and their commanding officers were sent to hold up the last line of defense outside Moscow. Most of them remained there for eternity.','https://image.tmdb.org/t/p/w500/bUmIyA8SOrV9QKRZlmjmryGl4D3.jpg','2020-11-04',6.9,0),(24987,'The Kite Runner','en','After spending years in California, Amir returns to his homeland in Afghanistan to help his old friend Hassan, whose son is in trouble.','https://image.tmdb.org/t/p/w500/dom2esWWW8C9jS2v7dOhW48LwHh.jpg','2007-12-14',7.3,0),(24988,'The Sucker','fr','In this Frenco-Italian gangster parody, a shop keeper on his way to an Italian holiday suffers a crash which totals his car. The culprit can only compensate his ruined trip by driving an American friends car from Napels to Bordeaux, but as it happens to be filled with such contraband as stolen money, jewelry and drugs, the involuntary and unwitting companions in crime soon attract all but recreational attention from the \"milieu\".','https://image.tmdb.org/t/p/w500/wmxzMpuW8Eq7MmPHn6jLDU8Q9ft.jpg','1965-03-24',7.4,0),(24989,'The Merchant of Venice','en','Venice, 1596. Bassanio begs his friend Antonio, a prosperous merchant, to lend him a large sum of money so that he can woo Portia, a very wealthy heiress; but Antonio has invested his fortune abroad, so they turn to Shylock, a Jewish moneylender, and ask him for a loan.','https://image.tmdb.org/t/p/w500/1VEyORoLcD22oP7cTch8k7fNjw1.jpg','2004-12-03',6.8,0),(24990,'Pierrot le Fou','fr','Pierrot escapes his boring society and travels from Paris to the Mediterranean Sea with Marianne, a girl chased by hit-men from Algeria. They lead an unorthodox life, always on the run.','https://image.tmdb.org/t/p/w500/i124H6iQB4CawrgFW9aZaZs7OBO.jpg','1965-11-05',7.5,0),(24991,'Ramona and Beezus','en','Ramona is a little girl with a very big imagination and a nose for mischief. Her playful antics keep everyone in her loving family on their toes, including her older sister Beezus, who\'s just trying to survive her first year of high school. Through all the ups and downs of childhood, Ramona and Beezus learn that anything\'s possible when you believe in yourself and rely on each other.','https://image.tmdb.org/t/p/w500/nBdwz67TKj9HDwpSxnCKIkXCQkp.jpg','2010-07-23',6.5,0),(24992,'Private Valentine: Blonde & Dangerous','en','When fluffy, bubble gum movie star Megan Valentine suddenly finds herself broke and humiliated in the public eye, she wanders from the wreckage of a car accident and witlessly enlists in the U.S. Army hoping in vain that it will change her life.','https://image.tmdb.org/t/p/w500/ExnJ2YhKdpwq7FUXNmDJQ42cBH.jpg','2008-11-07',6.3,0),(24993,'Robert the Bruce','en','In 1306, Scottish King Robert the Bruce turns a defeated outlaw when his country is invaded. But before to free his sacred land, he must manage to regain his will to fight back and survive the persecution of those who want take his head and the English gold.','https://image.tmdb.org/t/p/w500/e6eNN4EpGtbXAbsR97QgjnjHs6s.jpg','2019-06-28',5.4,0),(24994,'The Saint','en','Simon Templar (The Saint), is a thief for hire, whose latest job to steal the secret process for cold fusion puts him at odds with a traitor bent on toppling the Russian government, as well as the woman who holds its secret.','https://image.tmdb.org/t/p/w500/k43wPAVeepqzGwP52dKcknQjquj.jpg','1997-04-03',6.1,0),(24995,'Glengarry Glen Ross','en','When an office full of Chicago real estate salesmen is given the news that all but the top two will be fired at the end of the week, the atmosphere begins to heat up. Shelley Levene, who has a sick daughter, does everything in his power to get better leads from his boss, John Williamson, but to no avail. When his coworker Dave Moss comes up with a plan to steal the leads, things get complicated for the tough-talking salesmen.','https://image.tmdb.org/t/p/w500/nGZCeCfNseq1ee3cJLBp0rH0djT.jpg','1992-09-15',7.4,0),(24996,'Irresistible','en','A Democratic political consultant helps a retired Marine colonel run for mayor in a small, conservative Wisconsin town.','https://image.tmdb.org/t/p/w500/hUpYDriYa5YkwwxeafUsowTweBg.jpg','2020-07-01',6.1,0),(24997,'My Little Pony: Equestria Girls - Legend of Everfree','en','When Canterlot Highschool goes on a trip to Camp Everfree, they’re surprised to find a magical force is causing strange things to happen around camp. With the help of the Mane 6 and especially Sunset Shimmer, Twilight Sparkle must confront the dark “Midnight Sparkle” within herself  and embrace her newfound magical abilities to save the camp.','https://image.tmdb.org/t/p/w500/qIELtTaq1A4XdOm5GAGYGSjouLN.jpg','2016-10-01',7.4,0),(24998,'Shelter','en','Forced to give up his dreams of art school, Zach works dead-end jobs to support his sister and her son. Questioning his life, he paints, surfs and hangs out with his best friend, Gabe. When Gabe\'s older brother returns home for the summer, Zach suddenly finds himself drawn into a relationship he didn\'t expect.','https://image.tmdb.org/t/p/w500/eYA8KiSnIAbxtoIgg4lpZjB0dfz.jpg','2007-06-16',7.8,0),(24999,'Love in the Time of Cholera','en','In Colombia just after the Great War, an old man falls from a ladder; dying, he professes great love for his wife. After the funeral, a man calls on the widow - she dismisses him angrily. Flash back more than 50 years to the day Florentino Ariza, a telegraph boy, falls in love with Fermina Daza, the daughter of a mule trader.','https://image.tmdb.org/t/p/w500/pOswIFoNUcIWc4ec3coXliT5PJl.jpg','2007-10-04',6.6,0),(25000,'The F**k-It List','en','After a prank blows up a studious high school senior\'s life, he shares a list of certain things he wishes he\'d done differently — and maybe still can.','https://image.tmdb.org/t/p/w500/oIxGqt2XKTLEKLHVffIv9hUlW0T.jpg','2020-07-01',6.1,0),(25001,'Delta Force 2: The Colombian Connection','en','When DEA agents are taken captive by a ruthless South American kingpin, the Delta Force is reunited to rescue them in this sequel to the 1986 film.','https://image.tmdb.org/t/p/w500/37MyrPtWQpgwzxrxQrfSgDTXkYL.jpg','1990-08-24',5.3,0),(25002,'The Insider','en','Tells the true story of a 60 Minutes television series exposé of the tobacco industry, as seen through the eyes of a real tobacco executive, Jeffrey Wigand.','https://image.tmdb.org/t/p/w500/w695X0FvTlBCS7GSLHNILnrfqPm.jpg','1999-10-28',7.5,0),(25003,'Beowulf','en','Beowulf is a wanderer who learns about a man-eating creature called Grendel, which comes in the night to devour warriors trapped at the Outpost. The Outpost is ruled by Hrothgar. He has a daughter, whose husband may have been murdered by the Outpost\'s master of arms.','https://image.tmdb.org/t/p/w500/ktX5naCHfERaoDVaCUOITPIFrFd.jpg','1999-04-01',4.3,0),(25004,'Elvis','en','This biopic traces Elvis Presley’s life from his impoverished childhood to his meteoric rise to stardom to his triumphant conquering of Las Vegas.','https://image.tmdb.org/t/p/w500/fYsrWZrLZMH9duwXPtaoheunUz4.jpg','1979-02-10',6.7,0),(25005,'Romeo & Juliet','en','In Verona, bad blood between the Montague and Capulet families leads to much bitterness. Despite the hostility, Romeo Montague manages an invitation to a masked ball at the