onal Claudine novels.','https://image.tmdb.org/t/p/w500/z73Wer1DgObAwWnqZlOyeI33ROY.jpg','2018-09-21',6.9,0),(25010,'Assassin\'s Creed: Embers','en','Taking place after the events of Assassin\'s Creed: Revelations in the year 1524 in Tuscany, follow the retired Assassin Ezio Auditore as he teams up with Shao Jun during his final battles.','https://image.tmdb.org/t/p/w500/6aeKG4ko7hAd80sakNw49ktrcPE.jpg','2011-11-15',6.9,0),(25011,'Exorcismo Documentado','es','','https://image.tmdb.org/t/p/w500/i5djJKrzq8VhZvXALw9thDnFfnM.jpg','2012-09-01',7.3,0),(25012,'Blame It on Rio','en','Matthew Hollis is man on holiday in Rio with his best friend. Both men have teenage daughters with them. When Matthew falls for his best friend\'s amorous daughter named Jennifer, they embark on a secret, if slightly one-sided relationship. Jennifer\'s father is furious when he finds out about the \'older man\' in his daughter\'s life, and sets out to hunt him down with the aid of Matthew!','https://image.tmdb.org/t/p/w500/3AqPDrCWzNC8Fx9Oz5X4O9STIOh.jpg','1984-02-17',5.7,0),(25013,'Spy Hard','en','The evil Gen. Rancor has his sights set on world domination, and only one man can stop him: Dick Steele, also known as Agent WD-40. Rancor needs to obtain a computer circuit for the missile that he is planning to fire, so Steele teams up with Veronique Ukrinsky, a KGB agent whose father designed the chip. Together they try to locate the evil mastermind\'s headquarters, where Veronique\'s father and several other hostages are being held.','https://image.tmdb.org/t/p/w500/ohaS5UAT2FtAFWGqKUBSAVSJ0wC.jpg','1996-05-24',5.3,0),(25014,'The Wandering Earth - Special Edition: Beyond 2020','zh','','https://image.tmdb.org/t/p/w500/1AZ7cGuLRXrBUozEoQ5NQub2cyE.jpg','2020-11-26',7.6,0),(25015,'Flipper','en','Sandy Ricks is sent by his mom to Coral Key, a rustic island in the Florida keys, to spend the summer with his uncle Porter Ricks. Sandy dislikes everything about his new environment until a new friend comes 