udi, both suffering from terminal cancer, get to know each other in a hospital room. They drown their desperation in tequila and decide to take one last trip to the sea. Drunk and still in pajamas they steal the first fancy car they find, a 60\'s Mercedes convertible. The car happens to belong to a bunch of gangsters, which immediately start to chase it, since it contains more than the pistol Martin finds in the glove box.','https://image.tmdb.org/t/p/w500/dsY09zCxKDFjfV1oqXFJJpVrHdP.jpg','1997-02-20',7.6,0),(25021,'The Postman','it','Simple Italian postman learns to love poetry while delivering mail to a famous poet; he uses this to woo local beauty Beatrice.','https://image.tmdb.org/t/p/w500/cUaCpjVDefYShKyLmkcDsiPaBHn.jpg','1994-04-07',8,0),(25022,'Top Gunner','en','Recent graduates of a secluded U.S. Air Force base must protect a gene-editing bioweapon from the Russian military—who are desperate to seize the deadly viral agent at any cost.','https://image.tmdb.org/t/p/w500/w3pYxiYHcPlEIW44RYdQgNQESvE.jpg','2020-06-23',5.8,0),(25023,'Land of Mine','da','In the days following the surrender of Germany in May 1945, a group of young German prisoners of war is handed over to the Danish authorities and subsequently sent to the West Coast, where they are ordered to remove the more than two million mines that the Germans had placed in the sand along the coast. With their bare hands, crawling around in the sand, the boys are forced to perform the dangerous work under the leadership of a Danish sergeant.','https://image.tmdb.org/t/p/w500/7TOYH2VDnYbXpBKlrkdQZUSC3Du.jpg','2015-12-03',7.8,0),(25024,'Futurama: Bender\'s Big Score','en','The Planet Express crew return from cancellation, only to be robbed blind by hideous \"sprunging\" scam artists.  Things go from bad to worse when the scammers hack Bender, start traveling through time, and take Earth over entirely!  Will the crew be able to save the day, or will Bender\'s larcenous tendencies and their general incompetence doom them all?','https://image.tmdb.org/t/p/w500/bmVE90IHvx4uXQgtbRtu4RyMWpt.jpg','2007-11-27',7.4,0),(25025,'The Dilemma','en','Longtime friends Ronny and Nick are partners in an auto-design firm. They are hard at work on a presentation for a dream project that would really launch their company. Then Ronny spots Nick\'s wife out with another man, and in the process of investigating the possible affair, he learns that Nick has a few secrets of his own. As the presentation nears, Ronny agonizes over what might happen if the truth gets out.','https://image.tmdb.org/t/p/w500/a7EVBTqeh6NoCFDW24qIp11kyi9.jpg','2011-01-13',5.3,0),(25026,'The Andromeda Strain','en','When virtually all of the residents of Piedmont, New Mexico, are found dead after the return to Earth of a space satellite, the head of the US Air Force\'s Project Scoop declares an emergency. A group of eminent scientists led by Dr. Jeremy Stone scramble to a secure laboratory and try to first isolate the life form while determining why two people from Piedmont - an old alcoholic and a six-month-old baby - survived. The scientists methodically study the alien life form unaware that it has already mutated and presents a far greater danger in the lab, which is equipped with a nuclear self-destruct device designed to prevent the escape of dangerous biological agents.','https://image.tmdb.org/t/p/w500/i3rTxQRJaBJoBcY8VMUOPT2E8Hp.jpg','1971-03-12',7.1,0),(25027,'The Invisible Man','en','Working in Dr. Cranley\'s laboratory, scientist Jack Griffin was always given the latitude to conduct some of his own experiments. His sudden departure, however, has Cranley\'s daughter Flora worried about him. Griffin has taken a room at the nearby Lion\'s Head Inn, hoping to reverse an experiment he conducted on himself that made him invisible. But the experimental drug has also warped his mind, making him aggressive and dangerous. He\'s prepared to do whatever it takes to restore his appearance.','https://image.tmdb.org/t/p/w500/a8WoUk92OLHnU5sODmdGaOi5iaH.jpg','1933-11-03',7.5,0),(25028,'Investigation of a Citizen Above Suspicion','it','Rome, Italy. After committing a heinous crime, a senior police officer exposes evidence incriminating him because his moral commitment prevents him from circumventing the law and the social order it protects.','https://image.tmdb.org/t/p/w500/vPTZwlq1IC4o1DCsEZEl2uGljzm.jpg','1970-10-16',8.2,0),(25029,'Lola\'s Secret','it','Young man has his dreams come true when the sexy new maid seduces him. But she also has a secret that leads to trouble.','https://image.tmdb.org/t/p/w500/307yi4fItQfp4ObuvSY1kejZy9F.jpg','1984-05-04',4.5,0),(25030,'An American Haunting','en','Based on the true events of the only case in US History where a spirit caused the death of a man.','https://image.tmdb.org/t/p/w500/5ePaCimd7cA9zYNib8WfIbWnrCf.jpg','2005-05-05',5.6,0),(25031,'Breathe','en','Based on the true story of Robin, a handsome, brilliant and adventurous man whose life takes a dramatic turn when polio leaves him paralyzed.','https://image.tmdb.org/t/p/w500/wLu2N0QVfSpk10RJ17HLHyRUmww.jpg','2017-10-13',7.4,0),(25032,'Viking Blood','en','When a viking mercenary finds himself in the middle of a battle between the old gods and the new, he decides that neither side deserves to win. And so begins an epic battle between good and evil that will decide the fate of a nation.','https://image.tmdb.org/t/p/w500/dkUxVISgn7eSX19JWoe5d35HW7u.jpg','2019-02-01',6.5,0),(25033,'Win a Date with Tad Hamilton!','en','A small-town girl wins a date with a Hollywood star through a contest. When the date goes better than expected, a love triangle forms between the girl, the celebrity, and the girl\'s best friend.','https://image.tmdb.org/t/p/w500/uVY9qtDib6rHEqSWsC8iek68u4C.jpg','2004-01-23',5.7,0),(25034,'Bud Abbott and Lou Costello Meet Frankenstein','en','Two hapless freight handlers find themselves encountering Dracula, the Frankenstein Monster and the Wolf Man.','https://image.tmdb.org/t/p/w500/9sq