ia) back to the capital, which is said to have the power of time travel and foresee into the future.  Now in 2013, Squire Tang, funded by a mysterious financer, digs up three ancient icemen from the outskirt of China; they are Ying, Sao and Niehu. As he is transferring the icemen to Hong Kong for further studies, the vehicle involves in a traffic accident which, unexpectedly, defrosts Ying...','https://image.tmdb.org/t/p/w500/juAYTbpP05NR8co9GhDTPwEKqde.jpg','2014-04-17',5.6,0),(25051,'Out for Justice','en','Gino Felino is an NYPD detective from Brooklyn who knows everyone and everything in his neighborhood. Killing his partner was someone\'s big mistake... because he\'s now out for justice.','https://image.tmdb.org/t/p/w500/nmfM1diysOyrX4JbvwS7uOomyes.jpg','1991-04-12',6.1,0),(25052,'The Kid Detective','en','A once-celebrated kid detective, now 31, continues to solve the same trivial mysteries between hangovers and bouts of self-pity. Until a naive client brings him his first \'adult\' case, to find out who brutally murdered her boyfriend.','https://image.tmdb.org/t/p/w500/2WrT8AZUcDicvf5m8KVgspQEHK3.jpg','2020-10-16',6.6,0),(25053,'Clerks','en','Convenience and video store clerks Dante and Randal are sharp-witted, potty-mouthed and bored out of their minds. So in between needling customers, the counter jockeys play hockey on the roof, visit a funeral home and deal with their love lives.','https://image.tmdb.org/t/p/w500/zeFhNF0SXlYIvWXpaOLuXVQ3jB4.jpg','1994-09-13',7.4,0),(25054,'Wuthering Heights','en','Yorkshire moorlands, northern England, in the late 18th century. Young Heathcliff, rescued from the streets of Liverpool by Mr. Earnshaw, the owner of Wuthering Heights, an isolated farm, develops over the years an insane passion for Cathy, his foster sister, a sick obsession destined to end tragically.','https://image.tmdb.org/t/p/w500/7gEcoCve3lmPOIPRp54K73b6rDv.jpg','2011-09-09',5.9,0),(25055,'The Land Before Time III: The Time of the Great Giving','en','Littlefoot and his young friends Cera, Ducky and Spike are being harassed by a group of older dinosaurs led by Hyp. When a meteorite strikes nearby, it causes a drought. The resulting scarcity of resources creates animosity among the different species in the Great Valley. Littlefoot and his crew resolve to venture forth to find a solution - as does Hyp and his gang. Will the groups learn to cooperate, or will their rivalry destroy them?','https://image.tmdb.org/t/p/w500/abcJUBDHi6hxibSgm2bxYK1wAZK.jpg','1995-03-16',6.2,0),(25056,'Cabin Fever','en','A group of five college graduates rent a cabin in the woods and begin to fall victim to a horrifying flesh-eating virus, which attracts the unwanted attention of the homicidal locals.','https://image.tmdb.org/t/p/w500/vaUkSL7PbeeKfdFKOh9TYR9M1ds.jpg','2003-08-15',5.7,0),(25057,'Confessions of a Brazilian Call Girl','pt','Rachel is a girl, adopted by an upper middle class family, who rebelled at 17 and left her family and studies at a traditional college in Sao Paulo to become a call girl. Shortly after starting work, she decided to write a blog about her experiences. Since some clients thought she looked like a surfer she adopted the name \"Surfistinha\" which means little surfer girl.','https://image.tmdb.org/t/p/w500/9htMnu5Zg3WEpz6SccgzfxWfDPw.jpg','2011-02-25',6.4,0),(25058,'Harry & Meghan: A Royal Romance','en','Examine the history of Prince Harry and Meghan Markle from the moment they met after being set up by friends, through their initial courtship when they were able to keep their romance under wraps, and ultimately the intense global media attention surrounding their relationship and Meghan’s life as a divorced American actress.','https://image.tmdb.org/t/p/w500/2ODzSaM8EKF28mGjNTH3ptb3BJu.jpg','2018-05-13',7,0),(25059,'Wake Up, Ron Burgundy: The Lost Movie','en','While Ron Burgundy\'s rivalry with Veronica Corningstone escalates quickly, a group of unprofessional thieves better known as \'The Alarm Clock\' try to make the truth known, whatever that may mean...','https://image.tmdb.org/t/p/w500/7Qgojxe7aRkrDfUY9htcwKYI7ZN.jpg','2004-12-28',6,0),(25060,'Boogeyman 3','en','When a college student witnesses the alleged suicide of her roommate, it sets into motion a series of horrific events that cause her to fear the supernatural entity. As she tries to convince the rest of her dorm that the Boogeyman does exist, the evil force grows stronger and her friends begin to pay the price. Now she must stop this ultimate evil before the entire campus falls prey.','https://image.tmdb.org/t/p/w500/iOCBPiNeQ7tPuQDwxapNYuSLKT5.jpg','2008-10-17',5.2,0),(25061,'Ghost Dog: The Way of the Samurai','en','An African-American Mafia hit man who models himself after the samurai of old finds himself targeted for death by the mob. Jarmusch\'s spiritual gangster film tells the story of an inner-city hit man (Whitaker) who lives on a rooftop, training himself as a samurai in the strictest sense. He communicates primarily by carrier pigeon, while remaining loyal to a gangster (Tormey) who once saved his life.','https://image.tmdb.org/t/p/w500/gjcl07r9zgQ9tVo9alyHmysPFfX.jpg','1999-06-02',7.3,0),(25062,'The Perfection','en','When troubled musical prodigy Charlotte seeks out Elizabeth, the new star pupil of her former school, the encounter sends both musicians down a sinister path with shocking consequences.','https://image.tmdb.org/t/p/w500/tPDe68PDsgIGMs6wdJLtcwVVxA7.jpg','2018-09-20',6.5,0),(25063,'Junglee','hi','A vet returns home to his father\'s elephant reserve where he encounters and fights an international poacher\'s racket.','https://image.tmdb.org/t/p/w500/4Jwof1qQ6U99TZFkBCngBdfW8J2.jpg','2019-03-29',6.7,0),(25064,'Bad Santa 2','en','Fueled by cheap whiskey, greed and hatred, Willie Soke teams up with his angry little sidekick, Marcus, to knock off a Chicago charity on Christmas Eve. Along for the ride is chubby and cheery Thurman Merman, a 250-pound ray of sunshine who brings out Willie\'s sliver 