.org/t/p/w500/xxtK8DWdIwdxF5X2TJcIRDSEtE6.jpg','2018-07-06',8.1,0),(25108,'Catch and Release','en','Gray Wheeler just lost everything. But it could be the best thing that ever happened to her. After the death of her fiancé, Gray moves in with her late love\'s best friends. While Sam and Dennis do their best to cheer Gray up, Fritz doesn\'t seem to care. Once Gray breaks through Fritz\'s defenses, however, she finally sees why her fiancé thought so highly of him. As they spend more time together, Gray learns that her chances for love have not died out with her fiancé. But when some surprise guests show up on their doorstep, it\'ll take the love of all of her new friends to help Gray learn that life may be messy, but love is messier.','https://image.tmdb.org/t/p/w500/4NanpeAso4c2KFdjHiJ3stByHHS.jpg','2006-10-20',5.9,0),(25109,'Mystic Pizza','en','Three teenage girls come of age while working at a pizza parlor in Mystic, Connecticut.','https://image.tmdb.org/t/p/w500/of7XkpzU0AsnFxMwrmZfBBvkgxw.jpg','1988-10-13',6.3,0),(25110,'David Attenborough: A Life on Our Planet','en','The story of life on our planet by the man who has seen more of the natural world than any other. In more than 90 years, Attenborough has visited every continent on the globe, exploring the wild places of our planet and documenting the living world in all its variety and wonder. Addressing the biggest challenges facing life on our planet, the film offers a powerful message of hope for future generations.','https://image.tmdb.org/t/p/w500/zSKwyUDKDHiFU5syTTvQRDcGBPS.jpg','2020-09-28',8.5,0),(25111,'DragonHeart','en','In an ancient time when majestic fire-breathers soared through the skies, a knight named Bowen comes face to face and heart to heart with the last dragon on Earth, Draco. Taking up arms to suppress a tyrant king, Bowen soon realizes his task will be harder than he\'d imagined: If he kills the king, Draco will die as well.','https://image.tmdb.org/t/p/w500/yfoBpR6aQ4IKT46oALjGxxCthoZ.jpg','1996-05-31',6.5,0),(25112,'Tempus Tormentum','en','A drifter passing through a small town is drugged by three masked psychopaths and forced into a bizarre game of cat and mouse. He is chased through a series of more and more bizarre events until, in the end, he finds that this evening of terror has lasting consequences. It’s a feel bad film, nasty and brutish, red in tooth and claw.','https://image.tmdb.org/t/p/w500/8ZbJ7bDmcKr8GzqoKI00awhjqyH.jpg','2018-04-17',5.8,0),(25113,'Another 48 Hrs.','en','For the past four years, San Francisco cop Jack Cates has been after an unidentified drug kingpin who calls himself the Ice Man. Jack finds a picture that proves that the Ice Man has put a price on the head of Reggie Hammond, who is scheduled to be released from prison on the next day.','https://image.tmdb.org/t/p/w500/2gQaZQ6REriS7Gclv1akT5Urwgf.jpg','1990-06-08',6,0),(25114,'Regression','en','Minnesota, 1990. Detective Bruce Kenner investigates the case of young Angela, who accuses her father, John Gray, of an unspeakable crime. When John unexpectedly and without recollection admits guilt, renowned psychologist Dr. Raines is brought in to help him relive his memories and what they discover unmasks a horrifying nationwide mystery.','https://image.tmdb.org/t/p/w500/luHpMTmU1ygtEgdOTSSj0i9nd8E.jpg','2015-10-01',5.6,0),(25115,'They\'re Playing with Fire','en','A married college professor decides to seduce her student, whom she hired as a handyman for her yacht. The hesitant student succumbs to his buxom professor, but their romance is interrupted by her corrupt husband and a masked murderer.','https://image.tmdb.org/t/p/w500/rvsWF6BWsPbm9p9dQz4pu9mkrW8.jpg','1984-04-01',5.3,0),(25116,'A Twelve-Year Night','es','Uruguay, 1973. Having been crushed by the military dictatorship, surviving members of the Tupamaro guerillas are imprisoned and tortured. They must find a way to endure the coming 12 years.','https://image.tmdb.org/t/p/w500/k1SEABHjk34flsBQigm9ygMuUM4.jpg','2018-09-20',7.4,0),(25117,'The Joy Luck Club','en','Through a series of flashbacks, four Chinese women born in America and their respective mothers born in feudal China explore their pasts.','https://image.tmdb.org/t/p/w500/s1Sk0hhVARNs7i9wqRHqbCriu8n.jpg','1993-09-08',7.2,0),(25118,'The Cutting Edge: Chasing the Dream','en','A world class ice skater eager to take the top prize in the biggest competition around finds his dreams going up in flames after his partner suffers a debilitating injury in this romantic sports drama starring Matt Lanter, Francia Rosa, and Christy Carlson Romano. Zack (Lanter) was headed for the gold when his partner suffered an injury that made competing impossible, but could a feisty female hockey player prove the key to keeping his illustrious career on track? Alexandra is an amateur Latina hockey player who has never skated professionally and doesn\'t much care for Zack, though a little determination goes a long way in helping Zack convince her to join him on the ice. Now, as this unlikely pair begins the arduous training process that could make them both bona-fide superstars, the girl with the icy attitude finds her handsome partner\'s warmth and charm bringing about a most unexpected thaw.','https://image.tmdb.org/t/p/w500/uDUl4ncVq1EWgTvaATyo240wtNo.jpg','2008-03-16',6.9,0),(25119,'Perfect Strangers','es','During a lunar eclipse, seven friends gather for dinner and decide to play a game in which they must share with each other the content of every message, email or phone call they receive throughout the evening.','https://image.tmdb.org/t/p/w500/kecy3X0ac5JNDmuugrrgoz7U3pJ.jpg','2017-12-01',6.7,0),(25120,'Synecdoche, New York','en','A theater director struggles with his work, and the women in his life, as he attempts to create a life-size replica of New York inside a warehouse as part of his new play.','https://image.tmdb.org/t/p/w500/5UwdhrjXhUgsiDhe1dpS9z4yj7q.jpg','2008-10-24',7.7,0),(25121,'Jiang Ziya: Legend of Deification','zh','Atop the