riends stay behind. Trapped inside the locked mansion gates, the remaining guests uncover a horrifying secret and soon fall victim to seven vicious, blood-thirsty demons.','https://image.tmdb.org/t/p/w500/3OlNfFL0tNUh2SbXI6Qn6Mhbc2M.jpg','2009-08-30',5,0),(25167,'Moscow Does Not Believe in Tears','ru','This is a life story of three girlfriends from youth to autumn ages. Their dreams and wishes, love, disillusions...','https://image.tmdb.org/t/p/w500/m6nWRLCaKsGErs7x8rDj9XuTVEG.jpg','1980-02-11',7.7,0),(25168,'Two Brothers','en','Two tigers are separated as cubs and taken into captivity, only to be reunited years later as enemies by an explorer (Pearce) who inadvertently forces them to fight each other.','https://image.tmdb.org/t/p/w500/5I2pRuJI3SZVsxP5iaorGaczzkI.jpg','2004-04-07',7.1,0),(25169,'La Belle Époque','fr','Victor, a disillusioned sexagenarian, sees his life turned upside down on the day when Antoine, a brilliant entrepreneur, offers him a new kind of attraction: mixing theatrical artifices and historical reconstruction, this company offers his clients a chance to dive back into the era of their choice. Victor then chose to relive the most memorable week of his life: the one where, 40 years earlier, he met the great love.','https://image.tmdb.org/t/p/w500/eHojoVxYRyqGABgoiTYyfkYqTra.jpg','2019-11-06',7.4,0),(25170,'About Last Night','en','A modern reimagining of the classic romantic comedy, this contemporary version closely follows new love for two couples as they journey from the bar to the bedroom and are eventually put to the test in the real world.','https://image.tmdb.org/t/p/w500/z3dVYQtxXldDawz7d15wqt2PQLe.jpg','2014-02-14',6,0),(25171,'Hulk vs. Thor','en','For ages, Odin has protected his kingdom of Asgard. But every winter, the All-Father must rest and regain his strength for one week. During this time, all of Asgard\'s foes (including trolls, giants, dark elves, and demons) try to claim the realm for their own, but they are always stopped by Odin\'s son, the mighty Thor, albeit with the loss of many brave Asgardian warriors. Loki, god of mischief, has kidnapped Dr. Bruce Banner and brought him to Asgard with the help of Amora, once Thor\'s lover, now the supervillain known as the Enchantress. Loki makes Banner angry and he changes into the Hulk. The Enchantress then casts a spell over the Hulk which separates Banner from his monstrous alter-ego and grants Loki control over the Hulk\'s body.','https://image.tmdb.org/t/p/w500/g3Xba32JckNniqHUobP3UgPq31o.jpg','2009-01-27',6.7,0),(25172,'Dorian Gray','en','Seduced into the decadent world of Lord Henry Wotton, handsome young aristocrat Dorian Gray becomes obsessed with maintaining his youthful appearance, and commissions a special portrait that will weather the winds of time while he remains forever young. When Gray\'s obsession spirals out of control, his desperate attempts to safeguard his secret turn his once-privileged life into a living hell.','https://image.tmdb.org/t/p/w500/1dUXCi74e5E69BlVGhUhQ0YTBi.jpg','2009-09-09',6,0),(25173,'His Girl Friday','en','Hildy, the journalist former wife of newspaper editor Walter Burns, visits his office to inform him that she\'s engaged and will be getting remarried the next day. Walter can\'t let that happen and frames the fiancé, Bruce Baldwin, for one thing after another, to keep him temporarily held in prison, while trying to steer Hildy into returning to her old job as his employee.','https://image.tmdb.org/t/p/w500/da95rurNghmKWmraPyqP6IsnAt1.jpg','1940-01-18',7.4,0),(25174,'Pooka!','en','A struggling actor gets a holiday season job as a Christmas character in a plush suit to promote the hottest toy of the year, Pooka; he slowly develops two personalities—one when he\'s in the suit and one that\'s outside it.','https://image.tmdb.org/t/p/w500/q6Rmmz5MYWHBqqdxhW6nsj0vgts.jpg','2018-12-07',6,0),(25175,'Lego DC Comics - Super Heroes: Batman Be-Leaguered','en','When Batman, claiming to be a loner, refuses to join the 