mmy is now 23 years old but is still in fifth grade with his fairy-obsessed fifth grade teacher Mr. Crocker. Despite being grown up, Timmy finds a loophole in the fairy rulebook Da Rules: if he continues to act like a kid, he will still get to keep his fairies. However, the dilemma rises when Tootie, who was once a dorky girl when she was 10 years old, returns to Dimmsdale as an attractive woman. Timmy falls in love with her, a sign that he is growing up to an adult, which means he is closer to losing his fairies. Meanwhile, an oil business tycoon named Hugh J. Magnate, Jr., who teams up with Mr. Crocker, plans to use Timmy\'s fairies\' magic in order to promote his oil business.','https://image.tmdb.org/t/p/w500/lyLGhBZ4ljApZIp7SSnfAHvrG9w.jpg','2011-07-09',4.9,0),(25181,'Fortress','en','In the future, the inmates of a private underground prison are computer-controlled with cameras, dream readers, and devices that can cause pain or death. John (Christopher Lambert) and his illegally pregnant wife Karen (Loryn Locklin) are locked inside \"The Fortress\" but are determined to escape before the birth of their baby.','https://image.tmdb.org/t/p/w500/whMDDlgY0AmjMdLuaUDg8XsShWi.jpg','1992-09-30',6.1,0),(25182,'Across the Universe','en','When young dockworker Jude leaves Liverpool to find his estranged father in the United States, he is swept up by the waves of change that are re-shaping the nation. Jude falls in love with Lucy, who joins the growing anti-war movement. As the body count in Vietnam rises, political tensions at home spiral out of control and the star-crossed lovers find themselves in a psychedelic world gone mad.','https://image.tmdb.org/t/p/w500/447c8Te3DXC46rQvDEixKGO4dS6.jpg','2007-09-14',7.1,0),(25183,'Inside','fr','Four months after the death of her husband, a woman on the brink of motherhood is tormented in her home by a strange woman who wants her unborn baby.','https://image.tmdb.org/t/p/w500/f9moV5ksoyOjWQvYc13vQZR4hPv.jpg','2007-06-13',6.7,0),(25184,'Titus','en','Titus Andronicus returns from the wars and sees his sons and daughters taken from him, one by one. Shakespeare\'s goriest and earliest tragedy.','https://image.tmdb.org/t/p/w500/82mCeQoeT2C7h7vR6Ot9MQotE1R.jpg','1999-12-25',6.5,0),(25185,'Grace','en','A unique horror film told from the first-person perspective of Grace - a naive, virginal college freshman trying to deal with campus culture and her outgoing roommate as an evil entity takes over her body and unleashes chaos.','https://image.tmdb.org/t/p/w500/6ikvuPIo1kGuRQz70l3ecissZLS.jpg','2014-10-28',4.8,0),(25186,'A Gruta','pt','The only one survivor of a mysterious murderer that killed his wife, friends and the tourism guide who leaded them through a interdicted grotto, a boy become the only suspect to make the crime. He, however, claim for his innocence saying that your wife killed those people as she was possessed by an evil force. Refusing to talk to police officers who are in charge for the crime investigation, he asks for help to a nun.','https://image.tmdb.org/t/p/w500/nBdoS8tjWubpEyQnqmM6tpZR3GU.jpg','2020-10-29',6.3,0),(25187,'Dance of the Forty One','es','Mexico City, November 1901. The police raid a private home where a secret party is being held. Among those attending is the son-in-law of President Porfirio Díaz.','https://image.tmdb.org/t/p/w500/jcSqwsEtT7wKfQ8oKaaulMMGUdS.jpg','2020-11-19',7.9,0),(25188,'Most Wanted','en','Sgt. James Dunn, who is wrongly accused of assassination of the officer he had a row with, is saved from death row and recruited for top-secret special operations squad led by Lt. Col Grant Casey. Their mission is to neutralize criminals who had avoided conventional law enforcement methods. On his first Mission, James is made the fall guy for the assassination of the first lady and everyone is loo','https://image.tmdb.org/t/p/w500/8vKh2AnzJaRM1eALkBKEU97NK1B.jpg','1997-10-10',5.3,0),(25189,'The Tournament','en','Every ten or seven years in an unsuspecting town, The Tournament takes place. A battle royale between 30 of the world\'s deadliest assassins. The last man standing receiving the $10,000,000 cash prize and the title of Worlds No 1, which itself carries the legendary million dollar a bullet price tag.','https://image.tmdb.org/t/p/w500/zVkPQAIoCNDc8khNjmSAiTb3lV5.jpg','2009-05-01',5.9,0),(25190,'Swung','en','David’s life is on the slide: he’s broke, in the middle of a divorce and ‘can’t get it up’.  His girlfriend, Alice, is his rock, but the magazine she writes for is going down and the pressure is on to find a story.  While job hunting online, David stumbles across the perfect antidote to his boredom: a ‘Swingers’ site. The resulting inbox of lewd invitations on the home-laptop justifiably upsets Alice, until she realises this could be just the ‘story’ she needs.  The idea of uncovering the swinging scene causes quite a stir in Alice’s office and, much to David’s chagrin, she is urged to pursue the story.  Their first reluctant foray is an hysterically low-rent initiation, however, an unexpected upturn for David’s manhood is all the extra encouragement they need.  As events accelerate beyond their control the once adoring couple become lost and fundamental questions are asked of their relationship.','https://image.tmdb.org/t/p/w500/wRjm5zztXRUYhXEl3FQKbIbgtMC.jpg','2015-06-19',5.7,0),(25191,'The Mummy','en','An ancient Egyptian priest named Imhotep is revived when an archaeological expedition finds his mummy and one of the archaeologists accidentally reads an ancient life-giving spell. Imhotep escapes from the field site and searches for the reincarnation of the soul of his lover.','https://image.tmdb.org/t/p/w500/vSKpbZVvzqQcw6htiyEinbCY9vq.jpg','1932-01-01',6.8,0),(25192,'100 Girls','en','This sexy, teen-comedy is about a freshman, Matthew, at college who meets his dream girl in a dorm elevator during a blackout. He never sees her face, but instantly falls in love. In the morning, the power is restored, but the \"dream girl\" has vanished. All Matthew knows is that she lives in an all-girls dorm. He sets out on a semester-long journey to find his mystery girl amongst a hundred female suspects. Could it be Wendy? Dora? Arlene? Patty? Cynthia? Or the 95 other girls, any of whom could have been in that elevator with Matthew.','https://image.tmdb.org/t/p/w500/xOR20bEMA1BCc9Sg2NgKcSrO1wo.jpg','2000-09-01',5.8,0),(25193,'A Royal Seaside Romance','en','A real estate agent helps a prince who keeps his identity a secret buy property in his magical seaside hometown. After seeing the houses and spending time together, they become friends and then team up to stop the rebuilding of the town\'s port. But will the prince\'s true identity prevent a romance between them?','https://image.tmdb.org/t/p/w500/ihhHKmRyloQFtx1fKfZ6FGS5omN.jpg','2022-06-22',7.1,0),(25194,'Detention','zh','Set in Taiwan during the \'White Terror\' period of martial law, a high school girl who awakens in an empty school, only to find that her entire community has been abandoned except for one other student. Soon they realize that they have entered a realm filled with vengeful spirits and hungry ghosts.','https://image.tmdb.org/t/p/w500/8cKs4cPTAhAjjRAOjjXFbVnYc1l.jpg','2019-09-20',6.7,0),(25195,'Red Joan','en','London, England, May 2000. The peaceful life of elderly Joan Stanley is suddenly disrupted when she is arrested by the British Intelligence Service and accused of providing information to communist Russia during the forties.','https://image.tmdb.org/t/p/w500/uTQWDi31W4RpxviHGyiwEYHXDDA.jpg','2018-09-13',6.7,0),(25196,'Le Samouraï','fr','After carrying out a flawlessly planned hit, Jef Costello, a contract killer with samurai instincts, finds himself caught between a persistent police investigator and a ruthless employer, and not even his armor of fedora and trench coat can protect him.','https://image.tmdb.org/t/p/w500/5Fa6o5nfUPEatQ9b3OwEvdEdR7T.jpg','1967-10-25',7.9,0),(25197,'Married to the Mob','en','Angela de Marco is fed up with her gangster husband\'s line of work and wants no part of the crime world. When her husband is killed for having an affair with the mistress of mob boss Tony \"The Tiger\" Russo, Angela and her son depart for New York City to make a fresh start. Unfortunately, Tony has set his sights upon Angela -- and so has an undercover FBI agent looking to use her to bust Tony.','https://image.tmdb.org/t/p/w500/3mHFwDuix9eyEAXsQRxgAqA1ZzX.jpg','1988-08-19',5.9,0),(25198,'Ghost Shark','en','A coastal town is plagued by a supernatural man-eating shark. A ghost hunter joins forces with a sea captain to uncover the secrets of the area\'s dark past and find a way to exorcise the spectral predator.','https://image.tmdb.org/t/p/w500/gydvWMOAUWFd3znJU58rxuZnvkW.jpg','2013-08-22',5.1,0),(25199,'My Fair Lady','en','A snobbish phonetics professor agrees to a wager that he can take a flower girl and make her presentable in high society.','https://image.tmdb.org/t/p/w500/bTXVc29lGSNclf94VIZ49W4gGKl.jpg','1964-10-21',7.6,0),(25200,'Strangers on a Train','en','A deranged socialite accosts a tennis star with his theory that if two strangers trade murders, they can disguise their motives and avoid suspicion.','https://image.tmdb.org/t/p/w500/ihC083U7ef56Ui4x0P0dobojrZ1.jpg','1951-06-27',7.7,0),(25201,'Horse Girl','en','A socially awkward woman with a fondness for arts and crafts, horses, and supernatural crime shows finds her increasingly lucid dreams trickling into her waking life.','https://image.tmdb.org/t/p/w500/hNQ7st9dFXUXENMcsAuVxcrIBfA.jpg','2020-01-27',5.6,0),(25202,'Point Blank','en','A nurse is forced to spring a wounded murder suspect from the hospital when the man’s brother kidnaps his pregnant wife and wants to make a trade.','https://image.tmdb.org/t/p/w500/weAvkxl0dnPevIKD8fwHjiOi6tc.jpg','2019-07-12',6.1,0),(25203,'The 100 Year-Old Man Who Climbed Out the Window and Disappeared','sv','After living a long and colorful life, Allan Karlsson finds himself stuck in a nursing home. On his 100th birthday, he leaps out a window and begins an unexpected journey.','https://image.tmdb.org/t/p/w500/eexokDJNgyfpdTH30s102lSuc9A.jpg','2013-12-25',6.8,0),(25204,'First Knight','en','The timeless tale of King Arthur and the legend of Camelot are retold in this passionate period drama. Arthur is reluctant to hand the crown to Lancelot, and Guinevere is torn between her loyalty to her husband and her growing love for his rival. But Lancelot must balance his loyalty to the throne with the rewards of true love.','https://image.tmdb.org/t/p/w500/xuXkCcrvUTkehVXuTGpnfySsx0Z.jpg','1995-07-07',6.1,0),(25205,'Sparkle of Youth','vi','Tue Lam (Midu) is a young artist manager with a burning passion for her music group - The Air. However, a major incident occurred causing all plans for the group to be delayed. What will Tue Lam do to launch her group? With the story of the people behind the artist\'s aura, when Ta Hai Lam will have any more surprises besides the confusing combination of Midu and Le Duong Bao Lam?','https://image.tmdb.org/t/p/w500/fYjJBXDBZVWHY7IYo7FjWLOTF5F.jpg','2023-02-14',0,0),(25206,'Diary of a Mad Black Woman','en','Charles, an attorney, and Helen, his devoted wife, seemed to have everything – money, a beautiful mansion – the American Dream. However, as Helen prepares to celebrate their 18th wedding anniversary, her life takes an unexpected twist when she comes home to find her clothes packed up in a U-Haul van parked in the driveway. Charles is divorcing her and kicks her out. Helen moves in with her grandmother Madea, an old woman who doesn\'t take any lip from anyone. Madea helps Helen through these tough times by showing her what is really important in life. Helen is forced to rediscover love, life and religion on her pursuit for happiness.','https://image.tmdb.org/t/p/w500/e3MijvcHaMppp6sxNawsuLQEHjc.jpg','2005-02-25',6.7,0),(25207,'The Prophecy','en','The angel Gabriel comes to Earth to collect a soul which will end the