ate and replace them. The robot doubles actually succeed in killing Bill and Ted, but the two are determined to escape the afterlife, challenging the Grim Reaper to a series of games in order to return to the land of the living.','https://image.tmdb.org/t/p/w500/tldtDfLnPFOtTWp758EmIP2Hbz5.jpg','1991-07-19',6.3,0),(25213,'The Call','en','In the fall of 1987, a group of small-town friends must survive the night in the home of a sinister couple after a tragic accident occurs. Needing only to make a single phone call, the request seems horribly ordinary until they realize that this call could change their life…or end it.','https://image.tmdb.org/t/p/w500/iKmykghTmvQj6zum79TsdUL5mPF.jpg','2020-10-23',5.6,0),(25214,'Nightbreed','en','A troubled young man is drawn to a mythical place called Midian where a variety of monsters are hiding from humanity.','https://image.tmdb.org/t/p/w500/1ChluYH0BEvJo3gtYoFHnMZI660.jpg','1990-02-16',6.4,0),(25215,'Cheburashka','ru','What if Cheburashka really exists? What if he is not a plush toy, but quite a real furry animal that lives in an orange grove in a distant country? What if he finds himself in a small town by the sea and meets an uncommunicative old man who does not need him at all, meets a little boy who cannot speak, and his mother, who makes amazing chocolate, meets a strange aunt who wants to buy it and give it to her unsympathetic granddaughter, and many, many other people.','https://image.tmdb.org/t/p/w500/f6HS9vWi7QmXO8GUQkUc0Jzyt2u.jpg','2022-12-24',7.3,0),(25216,'Summer of 85','fr','What do you dream of when you\'re 16-years-old and in a seaside resort in Normandy in the 1980s? A best friend? A lifelong teen pact? Scooting off on adventures on a boat or a motorbike? Living life at breakneck speed? No. You dream of death. Because you can\'t get a bigger kick than dying. And that\'s why you save it till the very end. The summer holidays are just beginning, and this story recounts how Alexis grew into himself.','https://imag