lace transforms himself from Brooklyn street hustler (once selling crack to pregnant women) to one of the greatest rappers of all time: The Notorious B.I.G. Follow his meteoric rise to fame and his refusal to succumb to expectations - redefining our notion of \"The American Dream.\"','https://image.tmdb.org/t/p/w500/62NsZPgueSiE8y7dqtU3FSLFwYw.jpg','2009-01-16',6.9,0),(25222,'Places in the Heart','en','In 1930s Texas, a widow and her family fight to save their home by harvesting cotton.','https://image.tmdb.org/t/p/w500/bmWg3uVn700inqOiadxeFTmiqmV.jpg','1984-09-11',7.2,0),(25223,'Blood Ties','en','Two brothers, on either side of the law, face off over organized crime in Brooklyn during the 1970s.','https://image.tmdb.org/t/p/w500/7tMuywiZUoaAihEIkCu3BAL1xPC.jpg','2013-08-22',6.1,0),(25224,'Mental','en','A charismatic, crazy hothead transforms a family\'s life when she becomes the nanny of five girls.','https://image.tmdb.org/t/p/w500/tqwstYXYKtosbsIHMJdz3FOcCjs.jpg','2012-10-04',5.8,0),(25225,'Green Room','en','A punk rock band becomes trapped in a secluded venue after finding a scene of violence. For what they saw, the band themselves become targets of violence from a gang of white power skinheads, who want to eliminate all evidence of the crime.','https://image.tmdb.org/t/p/w500/evZicaR7nXe4LiD9G6QYTorcJGO.jpg','2015-09-25',6.7,0),(25226,'Man on the Moon','en','The story of the life and career of eccentric avant-garde comedian, Andy Kaufman.','https://image.tmdb.org/t/p/w500/msOZS07xRIFnapwp3fprGbKEAfT.jpg','1999-12-22',7.3,0),(25227,'Corporate Animals','en','Disaster strikes when the egotistical CEO of an edible cutlery company leads her long-suffering staff on a corporate team-building trip in New Mexico. Trapped underground, this mismatched and disgruntled group must pull together to survive.','https://image.tmdb.org/t/p/w500/ajnBS9iakB3R5RIWedq6BHvmxFq.jpg','2019-09-20',4.8,0),(25228,'Battle of the Year','en','A down-on-his-luck coach is hired to prepare a team of the best American dancers for an international tournament that attracts all the best crews from around the world, but the Americans haven\'t won in fifteen years.','https://image.tmdb.org/t/p/w500/klOquwqD8LtTvm9pWc1vJH143Zb.jpg','2013-09-21',7,0),(25229,'Earth Girls Are Easy','en','In this musical comedy, Valerie is dealing with her philandering fiancé, Ted, when she finds that a trio of aliens have crashed their spaceship into her swimming pool. Once the furry beings are shaved at her girlfriend\'s salon, the women discover three handsome men underneath. After absorbing the native culture via television, the spacemen are ready to hit the dating scene in 1980s Los Angeles.','https://image.tmdb.org/t/p/w500/pO9Edq8mgp9kD3N6EkCGYLnIVaA.jpg','1988-09-08',5.7,0),(25230,'Steve Jobs','en','Set backstage at three iconic product launches and ending in 1998 with the unveiling of the iMac, Steve Jobs takes us behind the scenes of the digital revolution to paint an intimate portrait of the brilliant man at its epicenter.','https://image.tmdb.org/t/p/w500/92vhEJ6xWoDJ8UHECAJaRofaSCZ.jpg','2015-10-09',6.8,0),(25231,'Pump Up the Volume','en','Mark Hunter, a lonely high school student, uses his shortwave radio to moonlight as the popular pirate DJ \"Hard Harry.\" When his show gets blamed for a teen committing suicide, the students clash with high school faculty and the authorities.','https://image.tmdb.org/t/p/w500/s1SyKrARJG2R7FyS4zkNdaekLAW.jpg','1990-08-22',7.1,0),(25232,'Premonition','en','A depressed housewife who learns her husband was killed in a car accident the day previously, awakens the next morning to find him alive and well at home, and then awakens the day after to a world in which he is still dead.','https://image.tmdb.org/t/p/w500/vKW1XIYrIqVrbCaYj9FQDHKXR8R.jpg','2007-02-08',6.3,0),(25233,'The Best Years of Our Lives','en','It\'s the hope that sustains the spirit of every GI: the dream of the day when he will finally return home. For three WWII veterans, the day has arrived. But for each man, the dream is about to become a nightmare.','https://image.tmdb.org/t/p/w500/gd5EoAU4MM57sW3vlWxJ0NMM8cV.jpg','1946-12-25',7.8,0),(25234,'Santa Sangre','en','A young man is confined in a mental hospital. Through a flashback we see that he was traumatized as a child, when he and his family were circus performers. Back in the present, he escapes and rejoins his surviving and armless mother.','https://image.tmdb.org/t/p/w500/sF4nk70J0FGBHlf0WTPWx7LS37l.jpg','1989-11-24',7.1,0),(25235,'Jodhaa Akbar','hi','A sixteenth century love story about a marriage of alliance that gave birth to true love between a Mughal emperor and a Rajput princess.','https://image.tmdb.org/t/p/w500/bEltVQbNJpsl9sopLVkE5z24Ssj.jpg','2008-02-13',7.4,0),(25236,'2 Days in the Valley','en','In a sleepy bedroom community of LA\'s San Fernando Valley, the murder of a professional athlete by two hit men sets into motion a chain of events that puts the mundane lives of a dozen residents on a collision course. This clever tale tells the story of two hit men, a mistress, a nurse, a vindictive ex-wife, a wealthy art dealer and his lovelorn assistant, a suicidal writer and his dog, and a bitter cop and his partner.','https://image.tmdb.org/t/p/w500/qKHZaEXK0Xb1v5BxehE3vaNIJiL.jpg','1996-09-11',6.2,0),(25237,'Manual of Love 2','it','Nicola, paralyzed after a car crash, falls in love for his physiotherapist Lucia. Franco and Manuela, a young couple unfit to have children, fly to Barcelona for a specialized treatment for fertility. Filippo and Fosco, two gay men, decide to marry. Ernesto, waiter in a chic restaurant, has a liaison with Cecilia, the new Spanish help.','https://image.tmdb.org/t/p/w500/2mDPqJ8HQNs9oyziI88EelJCzoO.jpg','2007-01-19',5.3,0),(25238,'1942: Unknown Battle','ru','WWII 1942: Rzhev, USSR. Stuck in a crucial strategical position, a small company from the Red Army does whatever it takes to fend off the Nazis.','https://image.tmdb.org/t/p/w500/k0dKShTvJZdqkwzJ4qqloy2nNFP.jpg','2019-12-05',7.8,0),(25239,'Quarantine','en','A television reporter and her cameraman are trapped inside a building quarantined by the CDC after the outbreak of a mysterious virus which turns humans into bloodthirsty killers.','https://image.tmdb.org/t/p/w500/rGfOD8IC1x4PqmnqRuA8KyCckia.jpg','2008-10-10',5.8,0),(25240,'Concussion','en','A dramatic thriller based on the incredible true David vs. Goliath story of American immigrant Dr. Bennet Omalu, the brilliant forensic neuropathologist who made the first discovery of CTE, a football-related brain trauma, in a pro player and fought for the truth to be known. Omalu\'s emotional quest puts him at dangerous odds with one of the most powerful institutions in the world.','https://image.tmdb.org/t/p/w500/gseayWAIFt3GQrEUNuUcYxT77Ud.jpg','2015-11-12',7.1,0),(25241,'Ruby Sparks','en','Calvin is a young novelist who achieved phenomenal success early in his career but is now struggling with his writing – as well as his romantic life. Finally, he makes a breakthrough and creates a character named Ruby who inspires him. When Calvin finds Ruby, in the flesh, sitting on his couch about a week later, he is completely flabbergasted that his words have turned into a living, breathing person.','https://image.tmdb.org/t/p/w500/sTkrd0PJJA468EHOsv242785sOb.jpg','2012-07-25',7.1,0),(25242,'Ghosts of Mars','en','In 2176, a Martian police unit is sent to pick up a highly dangerous criminal at a remote mining post. Upon arrival, the cops find the post deserted and something far more dangerous than any criminal — the original inhabitants of Mars, hellbent on getting their planet back.','https://image.tmdb.org/t/p/w500/i2zztssCIbahGES1fdfWFmDXian.jpg','2001-08-24',5.2,0),(25243,'Safety Not Guaranteed','en','Three magazine employees head out on an assignment to interview a guy who placed a classified ad seeking a companion for time travel.','https://image.tmdb.org/t/p/w500/bYiQAWmxRfzBie866SqOEEgtBXk.jpg','2012-06-08',6.8,0),(25244,'My Lucky Stars','cn','Two Hong-Kong cops are sent to Tokyo to catch an ex-cop who stole a large amount of money in diamonds. After one is captured by the Ninja-gang protecting the rogue cop, the other one gets his old Orphanage gang, dubbed the \"Five Lucky Stars,\" to help him. They don\'t like this much, but they do it.','https://image.tmdb.org/t/p/w500/dZzHBIcJsld2XMvwR75OZGf4NM2.jpg','1985-02-10',6.4,0),(25245,'It Must Be Heaven','en','Filmmaker Elia Suleiman travels to different cities and finds unexpected parallels to his homeland of Palestine.','https://image.tmdb.org/t/p/w500/5AJeDg97JlJxPEP38wDUlJ1OXgU.jpg','2019-12-04',6.5,0),(25246,'The Roommate','en','When Sara, a young design student from Iowa, arrives for college in Los Angeles, she is eager to fit in and get to know the big city. Her wealthy roommate, Rebecca, is more than eager to take Sara under her wing and show her the ropes. The two become close, but when Sara begins to branch out and make more friends on campus, Rebecca becomes resentful. Alarmed, Sara moves in with her new boyfriend, causing Rebecca\'s behavior to take a violent turn.','https://image.tmdb.org/t/p/w500/kQZcOn5rDuwpbQTluC4Wm0amYmR.jpg','2011-02-04',5.4,0),(25247,'The Principal','en','Burglary. Drugs. Assault. Rape. The students at Brandel High are more than new Principal Rick Latimer bargained for. Gangs fight to control the school using knives - even guns - when they have to. When Latimer and the head of security try to clean up the school and stop the narcotics trade, they run up against a teenage mafia. A violent confrontation on the campus leads to a deadly showdown with the drug dealer\'s gang, and one last chance for Latimer to save his career... and his life.','https://image.tmdb.org/t/p/w500/kwwDruwoHwNMY6tV7KOdVGcEusT.jpg','1987-09-18',6.5,0),(25248,'Justice League: Secret Origins','en','When global catastrophe strikes, the World\'s Greatest Super Heroes answer the call to join Justice League. Justice League works together as a team to overcome a dangerous array of intersteller invaders and world conquering megalomaniacs.','https://image.tmdb.org/t/p/w500/8osiXvK1nVSQgnZR1Bu8yBLP480.jpg','2001-11-17',7.8,0),(25249,'Kick the Cock','it','Kick the Cock is an old Dutch saying, meaning Peek in the Kitchen.','https://image.tmdb.org/t/p/w500/cEL0Pf5CJritkxBOFEBejW3R4wE.jpg','2008-09-04',4.1,0),(25250,'Taking Woodstock','en','The story of Elliot Tiber and his family, who inadvertently played a pivotal role in making the famed Woodstock Music and Arts Festival into the happening that it was. When Elliot hears that a neighboring town has pulled the permit on a hippie music festival, he calls the producers thinking he could drum up some much-needed business for his parents\' run-down motel. Three weeks later, half a million people are on their way to his neighbor’s farm in White Lake, New York, and Elliot finds himself swept up in a generation-defining experience that would change his life–and American culture–forever.','https://image.tmdb.org/t/p/w500/nfvmClvZE7KhIqB74OAgLQ2L6KW.jpg','2009-08-26',6.2,0),(25251,'A Million Little Pieces','en','A young drug-addled writer approaching the bottom of his descent submits to two months of agonizing detox at a treatment center in Minnesota.','https://image.tmdb.org/t/p/w500/loC9ptPrTT1e09frmddn6LU612d.jpg','2019-08-30',6.4,0),(25252,'Noelle','en','Kris Kringle\'s daughter, Noelle, sets off on a mission to find and bring back her brother, after he gets cold feet when it\'s his turn to take over as Santa.','https://image.tmdb.org/t/p/w500/2zHGNWo4vrAzB5ZqQC0e3p4A2lp.jpg','2019-11-12',6.7,0),(25253,'The Sisterhood of the Traveling Pants','en','Four best friends (Tibby, Lena, Carmen &amp; Bridget) who buy a mysterious pair of pants that fits each of them, despite their differing sizes, and makes whoever wears them feel fabulous. When faced with the prospect of spending their first summer apart, the pals decide they\'ll swap the pants so that each girl in turn can enjoy the magic.','https://image.tmdb.org/t/p/w500/wNshlUT6IZEz2AF3iZrlb2mX0pR.jpg','2005-06-01',6.5,0),(25254,'Scooby-Doo! Frankencreepy','en','Scooby-Doo and those \"meddling kids\" Shaggy, Fred, Daphne and Velma are back in this all-new original movie! Velma discovers she\'s inherited her great-great-uncle Dr. Von Dinkenstein’s cursed castle in the terrifying town of Transylvania…Pennsylvania, that is. Just when the Gang persuades Velma to go claim her inheritance, the ghost of Dinkenstein Castle blows up the Mystery Machine as a warning! Now the Crew must spring back into action, but this time it\'s personal! Who\'s responsible for the Dinkenstein monster? What family secret has Velma been hiding? Will Fred recover from the loss of his beloved Mystery Machine? Can any helpless snack survive Scooby and Shaggy\'s monster-sized appetites? This Scooby-Doo adventure has enough spooky fun to make the whole family come alive!','https://image.tmdb.org/t/p/w500/9Ql1KEdLPr0bl5503qFiUscDT1q.jpg','2014-08-19',7.8,0),(25255,'How to Make an American Quilt','en','Soon-to-be-wed graduate student Finn Dodd develops cold feet when she suspects her fiancé is cheating on her. In order to clear her head, Finn visits her grandmother, Hy, and great aunt, Glady Joe Cleary, in Grasse, Calif. There, Finn learns that Hy and Glady Joe are members of a group of passionate quilters, and over the course of her visit she is regaled with tales of love and life by women who have collected rich experiences and much wisdom.','https://image.tmdb.org/t/p/w500/vwYRaERccwXWCYrTzeWRZRarJOo.jpg','1995-10-06',6.4,0),(25256,'Anomalisa','en','An inspirational speaker becomes reinvigorated after meeting a lively woman who shakes up his mundane existence.','https://image.tmdb.org/t/p/w500/4DJ1zNr4Y6q7zQ27goEYla46VdO.jpg','2015-12-30',7.1,0),(25257,'Both Sides of the Blade','fr','Jean and Sara have been living together for 10 years. When they first met, Sara was living with François, Jean’s best friend and an admirer from back when he played rugby. Jean and Sara love each other. One day, Sara sees François in the street. He does not notice her, but she is overtaken by the sensation that her life could suddenly change. François gets back in touch with Jean. For the first time in years. He suggests they start working together again. From here on, things spiral out of control.','https://image.tmdb.org/t/p/w500/w0jUcrS42AyPNgb1RwjDm0BLaZz.jpg','2022-07-08',5.7,0),(25258,'D.E.B.S.','en','The star of a team of teenage crime fighters falls for the alluring villainess she must bring to justice.','https://image.tmdb.org/t/p/w500/cMwLTcG5aVBYeh5W6SVSfowboAf.jpg','2004-01-21',6.4,0),(25259,'Che: Part Two','en','After the Cuban Revolution, Che is at the height of his fame and power. Then he disappears, re-emerging incognito in Bolivia, where he organizes a small group of Cuban comrades and Bolivian recruits to start the great Latin American Revolution. Through this story, we come to understand how Che remains a symbol of idealism and heroism that lives in the hearts of people around the world.','https://image.tmdb.org/t/p/w500/t9nH3bZf0Ezs2jwk0bTkvRr89Ao.jpg','2008-12-12',6.7,0),(25260,'On My Skin','it','The incredible true story behind the most controversial Italian court cases in recent years. Stefano Cucchi was arrested for a minor crime and mysteriously found dead during his detention. In one week\'s time, a family is changed forever.','https://image.tmdb.org/t/p/w500/rwPgE6fLxuJmPWi8fFjgENJMAjr.jpg','2018-09-12',8.1,0),(25261,'Creep 2','en','After finding an ad online for “video work,” Sara, a video artist whose primary focus is creating intimacy with lonely men, thinks she may have found the subject of her dreams. She drives to a remote house in the forest and meets a man claiming to be a serial killer. Unable to resist the chance to create a truly shocking piece of art, she agrees to spend the day with him. However, as the day goes on, she discovers she may have dug herself into a hole from which she can’t escape.','https://image.tmdb.org/t/p/w500/a0m7WciFnBqpcyH1Yi8i4tdvk0k.jpg','2017-10-14',6.3,0),(25262,'Iron Eagle','en','When Doug\'s father, an Air Force Pilot, is shot down by MiGs belonging to a radical Middle Eastern state, no one seems able to get him out. Doug finds Chappy, an Air Force Colonel who is intrigued by the idea of sending in two fighters piloted by himself and Doug to rescue Doug\'s father after bombing the MiG base.','https://image.tmdb.org/t/p/w500/saT7AqyIAMukqlID9trxEbBKmUn.jpg','1986-01-17',5.5,0),(25263,'MFKZ','fr','Angelino is just one of thousands of deadbeats living in Dark Meat City. But an otherwise unremarkable scooter accident caused by a beautiful, mysterious stranger is about to transform his life... into a waking nightmare! He starts seeing monstrous forms prowling around all over the city... Is Angelino losing his mind, or could an alien invasion really be happening this quietly...?','https://image.tmdb.org/t/p/w500/oSMIKsznGYzGfdl611kgEJF889.jpg','2018-05-23',7.1,0),(25264,'Hart\'s War','en','Fourth-generation Army Col. William McNamara is imprisoned in a brutal German POW camp. Still, as the senior-ranking American officer, he commands his fellow inmates, keeping a sense of honor alive in a place where honor is easy to destroy, all under the dangerous eye of the Luftwafe vetran Col. Wilhelm Visser. Never giving up the fight to win the war, McNamara is silently planning, waiting for his moment to strike back at the enemy. A murder in the camp gives him the chance to set a risky plan in motion. With a court martial to keep Visser and the Germans distracted, McNamara orchestrates a cunning scheme to escape and destroy a nearby munitions plant, enlisting the unwitting help of young Lt. Tommy Hart. Together with his men, McNamara uses a hero\'s resolve to carry out his mission, ultimately forced to weigh the value of his life against the good of his country.','https://image.tmdb.org/