ter, Nina, is openly hostile to Dot, but that does not prevent her from telling her secrets to her silent stepsister, including the fact that she wants to kill her lecherous father.','https://image.tmdb.org/t/p/w500/lXIuHcRGCRk0YBOi41MCHMvGst5.jpg','2005-09-12',6.2,0),(25271,'Team America: World Police','en','Team America World Police follows an international police force dedicated to maintaining global stability. Learning that dictator Kim Jong il is out to destroy the world, the team recruits Broadway star Gary Johnston to go undercover. With the help of Team America, Gary manages to uncover the plan to destroy the world. Will Team America be able to save it in time? It stars… Samuel L Jackson, Tim Robbins, Sean Penn, Michael Moore, Helen Hunt, Matt Damon, Susan Sarandon, George Clooney, Danny Glover, Ethan Hawke, Alec Baldwin… or does it?','https://image.tmdb.org/t/p/w500/m1Q2VFe1DVVbjfu1LDZe7tlp9yb.jpg','2004-10-10',6.7,0),(25272,'Laura','en','A police detective falls in love with the woman whose murder he\'s investigating.','https://image.tmdb.org/t/p/w500/AtZFZSLN3rSMxTQYN9LRpQzDOgh.jpg','1944-10-11',7.7,0),(25273,'Minions: Puppy','en','A Minion, seeing many owners walk their dogs, wants a puppy of his own. He tries to leash a ladybug but fails. Luckily, a UFO that sweeps away the ladybug somehow agrees to become a Puppy.','https://image.tmdb.org/t/p/w500/f62rLpyiebBc6QfSTA4xGwwQkPY.jpg','2013-12-10',7.2,0),(25274,'The Sleeping Dictionary','en','A young Englishman is dispatched to Sarawak to become part of the British colonial government. He encounters some unorthodox local traditions, and finds himself faced with tough decisions of the heart involving the beautiful Selima, the unwitting object of his affections.','https://image.tmdb.org/t/p/w500/fOFcv1LlQLpG4svZa6bm0ND1njV.jpg','2003-01-31',6.6,0),(25275,'Aniara','sv','A ship carrying settlers to a new home on Mars after Earth is rendered uninhabitable is knocked off-course, causing the passengers to consider their place in the universe.','https://image.tmdb.org/t/p/w500/pEpEJe8NTmwWL0hwYkZguTzEqzt.jpg','2019-02-01',6.1,0),(25276,'Guilty as Sin','en','Before a criminal lawyer knows what has happened, she is forced to defend a wife killer she knows is guilty.','https://image.tmdb.org/t/p/w500/8PldNxVvmHBbxWRkrVionkMNMyd.jpg','1993-06-04',5.7,0),(25277,'D-Tox','en','A disgraced FBI agent with a drinking problem joins nine other troubled law enforcement officers at an isolated detox clinic in the wilds of Wyoming. But the therapeutic sanctuary becomes a nightmarish hellhole when a major snowstorm cuts off the clinic from the outside world and enables a killer on the inside to get busy.','https://image.tmdb.org/t/p/w500/AdLg3zOxCcyWQYKSK86q20dibq.jpg','2002-01-04',5.6,0),(25278,'Just Cause','en','A Harvard professor is lured back into the courtroom after twenty-five years to take the case of a young black man condemned to death for the horrific murder of a child.','https://image.tmdb.org/t/p/w500/z8WqDIUC00TPX6U24ah0C7IMEKf.jpg','1995-02-17',6.2,0),(25279,'Sorry We Missed You','en','Ricky and his family have been fighting an uphill struggle against debt since the 2008 financial crash. An opportunity to wrestle back some independence appears with a shiny new van and the chance to run a franchise as a self-employed delivery driver. It\'s hard work, and his wife\'s job as a carer is no easier. The family unit is strong but when both are pulled in different directions everything comes to breaking point.','https://image.tmdb.org/t/p/w500/7ZhrE1RFiOWn4QuJsHFkuEgndOo.jpg','2019-10-04',7.4,0),(25280,'The Cowboys','en','When his cattlemen abandon him for the gold fields, rancher Wil Andersen is forced to take on a collection of young boys as his cowboys in order to get his herd to market in time to avoid financial disaster. The boys learn to do a man\'s job under Andersen\'s tutelage; however, neither Andersen nor the boys know that a gang of cattle thieves is stalking them.','https