rs of war.','https://image.tmdb.org/t/p/w500/k5Q76tzV2T4RtDdYwNj64c1qQ16.jpg','2005-08-12',6.6,0),(25369,'Trading Paint','en','A stock car racing legend is drawn back to the dirt track when his son, an aspiring driver, joins a rival racing team.','https://image.tmdb.org/t/p/w500/yV9G1nO6YxEWzXblqMUFoS19R9v.jpg','2019-02-22',5.5,0),(25370,'Maximum Conviction','en','When former black ops operative Cross and his partner Manning are assigned to decommission an old prison, they must oversee the arrival of two mysterious female prisoners. Before long, an elite force of mercenaries assault the prison in search of the new arrivals. As the true identities of the women are revealed, Cross realizes he\'s caught in the middle of something far bigger than he had imagined.','https://image.tmdb.org/t/p/w500/vi1VSmpNoPsjiFGSBCGegrHoCvX.jpg','2012-10-25',5.1,0),(25371,'United 93','en','A real-time account of the events on United Flight 93, one of the planes hijacked on 9/11 that crashed near Shanksville, Pennsylvania when passengers foiled the terrorist plot.','https://image.tmdb.org/t/p/w500/aahr1uIPrEej8q4baE1RYXOXwFB.jpg','2006-04-28',7.1,0),(25372,'Hotel Rwanda','en','Inspired by true events, this film takes place in Rwanda in the 1990s when more than a million Tutsis were killed in a genocide that went mostly unnoticed by the rest of the world. Hotel owner Paul Rusesabagina houses over a thousand refuges in his hotel in attempt to save their lives.','https://image.tmdb.org/t/p/w500/p3pHw85UMZPegfMZBA6dZ06yarm.jpg','2004-03-04',7.7,0),(25373,'The Atticus Institute','en','In the early 1970s, Dr. Henry West creates an institute to find people with supernatural abilities. When Judith Winstead comes to the facility, she exhibits amazing abilities that the military wants to turn into a weapon.','https://image.tmdb.org/t/p/w500/43dvapnp9DvDvc8JbLCdq63h3zq.jpg','2015-01-20',5.7,0),(25374,'Small Fry','en','A fast food restaurant mini variant of Buzz forcibly switches places with the rea