ral cases of dynamite (which is so old that it is dripping unstable nitroglycerin) across dangerous jungle terrain.','https://image.tmdb.org/t/p/w500/cftvieqsfGgmZ0u3AeInfahvPzr.jpg','1977-06-24',7.4,0),(25390,'Bugs Bunny\'s 3rd Movie: 1001 Rabbit Tales','en','If Bugs Bunny were to direct his signature inquiry--\"What\'s up, doc?\"--toward the modern-day Warner Bros. creative team, he wouldn\'t be far off. For 1001 Rabbit Tales, they\'ve doctored up a batch of classic cartoons featuring the carrot muncher and his bumbling comrades and bundled them, near seamlessly, into a feature-length film. Here\'s the premise: Bugs and Daffy, both book salesmen, are competing to sell the most copies of a kids\' book. Instead of burrowing a beeline to his sales territory (he should have made a left at Albuquerque), Bugs ends up in the castle of Yosemite Sam, here a harem-leading honcho. Sam\'s pain-in-the-spurs son, Prince Abalaba, needs somebody to read him stories; Bugs, who\'d sooner take the job than suffer the alternative, that involving being boiled in oil, signs on.','https://image.tmdb.org/t/p/w500/eKEVTvfEHSxLI5fwNKiMjQRyjyq.jpg','1982-11-19',7.1,0),(25391,'Welcome to Valentine','en','After losing her boyfriend and her job right before Valentine\'s Day, Olivia is introduced to George who takes her on a cross country road trip that has them reevaluating their priorities.','https://image.tmdb.org/t/p/w500/r6Msewaf41FUFT6XIr1Hn7VHOr4.jpg','2023-02-18',0,0),(25392,'Ala Vaikunthapurramuloo','te','Fate plays a vital role in connecting the life of Bantu, a son who seeks validation from his cold-hearted father with the life of Raj, whose millionaire father wishes that he was more assertive.','https://image.tmdb.org/t/p/w500/48DIQOSEgpoWUFBrmHW2En6aNZQ.jpg','2020-01-12',6.9,0),(25393,'A Civil Action','en','Jan Schlickmann is a cynical lawyer who goes out to \'get rid of\' a case, only to find out it is potentially worth millions. The case becomes his obsession, to the extent that 