nd runs the agency Total Failures with his best friend, an imaginary 1,200 pound polar bear.','https://image.tmdb.org/t/p/w500/9Ic99kyJewgPHwl4JftJSwzUmtD.jpg','2020-01-25',6.2,0),(25443,'Look Who\'s Talking Too','en','Mollie and James are together and raising a family, which now consists of an older Mikey and his baby sister, Julie. Tension between the siblings arises, and as well with Mollie and James when Mollie\'s brother Stuart moves in. Mikey is also learning how to use the toilet for the first time.','https://image.tmdb.org/t/p/w500/m409mVHmvDOZJltNzHJYigUthsW.jpg','1990-12-14',5.5,0),(25444,'Legends of Oz: Dorothy\'s Return','en','Dorothy wakes up in post-tornado Kansas, only to be whisked back to Oz to try to save her old friends the Scarecrow, the Lion, the Tin Man and Glinda from a devious new villain, the Jester. Wiser the owl, Marshal Mallow, China Princess and Tugg the tugboat join Dorothy on her latest magical journey through the colorful landscape of Oz to restore order and happiness to Emerald City.','https://image.tmdb.org/t/p/w500/mpMX4avGjpQ0LSgDUTebxdTD81T.jpg','2014-05-08',6.4,0),(25445,'Super Fuzz','it','While delivering a parking ticket to a small village in the Florida everglades, Officer Dave Speed finds himself in the middle of a radiation experiment conducted by the American government and NASA, where a detonated nuclear missile gives him a multitude of superpowers.','https://image.tmdb.org/t/p/w500/8kSgFV7nvzLVJhmVkq8n4k2VoC0.jpg','1980-09-18',6.5,0),(25446,'Hair','en','Upon receiving his draft notice and leaving his family ranch in Oklahoma, Claude heads to New York and befriends a tribe of long-haired hippies on his way to boot camp.','https://image.tmdb.org/t/p/w500/z0ctToyPWCB2RgIkMpD6RhRKAeH.jpg','1979-03-14',7.3,0),(25447,'Some Kind of Beautiful','en','By day, Richard Haig is a successful and well-respected English professor at renowned Trinity College in Cambridge.  By night, Richard indulges his own romantic fantasies with a steady stream of beautiful undergraduates.  But Richard has grown tired of the  game and is looking for something more meaningful and lasting.  So when Kate, Richard’s tanned, athletic, 25-year-old American girlfriend tells him that she is pregnant, Richard is thrilled.  He looks forward to having a family of his own,  being a father his children could be proud of, not some sex-fueled bobcat.  There is only one problem.  Richard’s not in love with Kate.  Richard is in love with Kate’s sister, Olivia. He had been in love with her ever since he first saw her.','https://image.tmdb.org/t/p/w500/2rW0u6qDw8kBRS4Ak3Wx1uauYaq.jpg','2015-07-16',5.6,0),(25448,'A Family Man','en','Dane Jensen is a driven, Chicago-based headhunter, working at a cut-throat job placement firm. When Dane\'s boss announces his retirement, he pits Dane against Lynn Vogel, Dane\'s equally driven but polar-opposite rival at the firm, in a battle for control over the company.','https://image.tmdb.org/t/p/w500/hCUrI8v523NQDJNKoDxGq2nvbvw.jpg','2017-05-18',6.7,0),(25449,'Fight Back to School 3','cn','Chow Sing-Sing returns, only this time he doesn’t go back to school. Instead, Chow goes undercover as the husband of a wealthy socialite, which doesn’t sit well with his fiancée, who tries to convince Chow to quit working as undercover.','https://image.tmdb.org/t/p/w500/gwq4z0x4ISsXI9Ra9EJhBIzyUTN.jpg','1993-01-14',6.6,0),(25450,'Les Misérables','en','Jean Valjean, a Frenchman imprisoned for stealing bread, must flee a police officer named Javert. The pursuit consumes both men\'s lives, and soon Valjean finds himself in the midst of the student revolutions in France.','https://image.tmdb.org/t/p/w500/3TOgmlIY8X3WjIjvU7Z0jqeNkyU.jpg','1998-05-01',7.2,0),(25451,'Exotica','en','In the upscale Toronto strip club Exotica, dancer Christina is visited nightly by the obsessive Francis, a depressed tax auditor. Her ex-boyfriend, the club\'s MC, Eric, still jealously pines for her even as he introduces her onstage, but Eric is having his own relationship problems with the club\'s female owner. Thomas, a mysterious pet-shop owner, is about to become unexpectedly involved in their lives.','https://image.tmdb.org/t/p/w500/3pibvRQK3A1E8cyhX8IQPIAU2J8.jpg','1994-11-30',6.6,0),(25452,'Paper Moon','en','During the Great Depression, a con man finds himself saddled with a young girl—who may or may not be his daughter—and the two forge an unlikely partnership.','https://image.tmdb.org/t/p/w500/3GHG0kTcBWHKdXjj3RdK8GjBCd6.jpg','1973-05-09',7.9,0),(25453,'Equals','en','A futuristic love story set in a world where emotions have been eradicated.','https://image.tmdb.org/t/p/w500/vP1i0dddTbLL3pyddrSCPnJa8S7.jpg','2015-07-15',6.1,0),(25454,'Cars','en','“I don’t drive, but I know people who’ll drive 100 metres to go to the shops. Our society is obsessed with the car, with coming and going, getting somewhere. I used very intricate matting, some shaped like knives. I wanted the cars to slice each other in two, creating a kind of hurdy gurdy atmosphere…an abstract rushing to and fro, going nowhere. The first half of the film is silent. The second half, a grainy dupe of the same images, has sound and is far more urgent and aggressive.” (Paul Winkler)','https://image.tmdb.org/t/p/w500/q6cF3LzBgPJghOb1UQHUGD8v8Hg.jpg','1979-01-01',0,0),(25455,'Nights of Cabiria','it','Rome, 1957. A woman, Cabiria, is robbed and left to drown by her boyfriend, Giorgio. Rescued, she resumes her life and tries her best to find happiness in a cynical world. Even when she thinks her struggles are over and she has found happiness and contentment, things may not be what they seem.','https://image.tmdb.org/t/p/w500/xF4oCG3PLNbcrtPZbqB3BtkIbKg.jpg','1957-10-03',8,0),(25456,'Daniel & Ana','es','Being kidnapped shatters a brother and sister\'s harmony, forcing them to confront their desires.','https://image.tmdb.org/t/p/w500/9qdUuckSL6OAwp6aUpbMY6513YB.jpg','2009-05-18',6.6,0),(25457,'Little Man Tate','en','Dede is a sole parent trying to bring up her son Fred. When it is discovered that Fred is a genius, she is determined to ensure that Fred has all the opportunities that he needs, and that he is not taken advantage of by people who forget that his extremely powerful intellect is harboured in the body and emotions of a child.','https://image.tmdb.org/t/p/w500/bVj97TGirraAQFsefm7Ss5cVuXW.jpg','1991-09-06',6.5,0),(25458,'Nitram','en','Based on true events, \"Nitram\" lives with his parents in suburban Australia in the mid-90s. He lives a life of isolation and frustration at never fitting in. As his anger grows, he begins a slow descent into a nightmare that culminates in the most heinous of acts.','https://image.tmdb.org/t/p/w500/qOmOMMgqZj7vooTDEqzOUF4jzX0.jpg','2021-09-30',7.1,0),(25459,'The Farewell','en','A headstrong Chinese-American woman returns to China when her beloved grandmother is given a terminal diagnosis. Billi struggles with her family\'s decision to keep grandma in the dark about her own illness as they all stage an impromptu wedding to see grandma one last time.','https://image.tmdb.org/t/p/w500/7ht2IMGynDSVQGvAXhAb83DLET8.jpg','2019-07-12',7.5,0),(25460,'Song of the Sea','en','The story of the last Seal Child’s journey home. After their mother’s disappearance, Ben and Saoirse are sent to live with Granny in the city. When they resolve to return to their home by the sea, their journey becomes a race against time as they are drawn into a world Ben knows only from his mother’s folktales. But this is no bedtime story; these fairy folk have been in our world far too long. It soon becomes clear to Ben that Saoirse is the key to their survival.','https://image.tmdb.org/t/p/w500/3DBX7QOEzWPNcDhqXInk6GBEvhK.jpg','2014-09-06',8,0),(25461,'The Descendants','en','With his wife Elizabeth on life support after a boating accident, Hawaiian land baron Matt King takes his daughters on a trip from Oahu to Kauai to confront a young real estate broker, who was having an affair with Elizabeth before her misfortune.','https://image.tmdb.org/t/p/w500/um7AY25jR7YmrS1pVHNuijmylKl.jpg','2011-09-09',6.8,0),(25462,'Children of the Corn III: Urban Harvest','en','Two young Gatlin residents are orphaned after the younger brother kills their father. The terror of Gatlin goes urban when the two boys are placed in the custody of two foster parents in the city. The younger brother takes some corn seeds along for the road and plants them in the courtyard of an abandoned warehouse, bringing \"He Who Walks Behind the Rows\" to the city.','https://image.tmdb.org/t/p/w500/xTNGI3MGTlOTiYU9ucfWd79kV2k.jpg','1995-09-12',4.7,0),(25463,'Medusa: Queen of the Serpents','en','After being bitten by a lethal snake, a young woman experiences changes in her senses and appearance, as she sheds her old self and slowly turns into a deadly weapon.','https://image.tmdb.org/t/p/w500/fs8RXnnJkYKo53R8A6eakzcTTHj.jpg','2021-07-21',6.3,0),(25464,'The Ward','en','Kristen, a troubled young woman, is captured by the police after burning down a farmhouse and is locked in the North Bend Psychiatric Hospital. Soon, she begins to suspect that the place has a dark secret at its core and she\'s determined to find out what it is.','https://image.tmdb.org/t/p/w500/x2dqoY5cYop46SKebNXRNL5EXEM.jpg','2010-09-13',5.8,0),(25465,'The Man from Earth','en','An impromptu goodbye party for Professor John Oldman becomes a mysterious interrogation after the retiring scholar reveals to his colleagues he never ages and has walked the earth for 14,000 years.','https://image.tmdb.org/t/p/w500/V086R82gNgWrotaXZFO4JhdgB1.jpg','2007-06-10',7.6,0),(25466,'The Quiet Man','en','An American man returns to the village of his birth in Ireland, where he finds love and conflict.','https://image.tmdb.org/t/p/w500/u3B1hVKHE56yBRoxF3Nk9uxHdYN.jpg','1952-07-21',7.3,0),(25467,'Fragile','en','Haunted by memories of a patient\'s death, a nurse  takes a job at an antiquated hospital for children. Soon she learns that the kids fear a ghost that prowls the floors and will not allow anyone to leave. Amy tries to protect them and convince the other staffers of the evil that lurks there.','https://image.tmdb.org/t/p/w500/s7gCOegufXiQR48IhuTsPNy0Fav.jpg','2005-10-14',6.5,0),(25468,'Straw Dogs','en','David Sumner, a mild-mannered academic from the United States, marries Amy, an Englishwoman. In order to escape a hectic stateside lifestyle, David and his wife relocate to the small town in rural Cornwall where Amy was raised. There, David is ostracized by the brutish men of the village, including Amy\'s old flame, Charlie. Eventually the taunts escalate, and two of the locals rape Amy. This sexual assault awakes a shockingly violent side of David.','https://image.tmdb.org/t/p/w500/yigkfHE1OhkxPPrjrV78Y9ibGEk.jpg','1971-12-23',7.1,0),(25469,'Hellraiser: Deader','en','In London, after investigating crack addicted junkies for an article in her newspaper, Amy Klein watches a bizarre videotape where an underground group of youngsters in Bucharest apparently become zombies. Amy finds Marla dead with a puzzle cube in her hands. She brings the object to her hotel room, and opens it, beginning her journey to hell.','https://image.tmdb.org/t/p/w500/7G7npapXYc2o4anYtJM11Aki0Sn.jpg','2005-06-07',4.6,0),(25470,'Christmas with a View','en','This Christmas, Thunder Mountain Ski Resort is abuzz when celebrity chef Shane Roarke is named the new head chef. Clara Garrison isn\'t as excited and is instead focused on getting resettled after her failed attempt at opening a restaurant in the city. With their paths constantly crossing, will their shared passion for cooking bring them together or will secrets keep them apart?','https://image.tmdb.org/t/p/w500/jzDSyPq80DPRzTryh9qBOiJQI8o.jpg','2018-11-01',5.8,0),(25471,'Skins','es','In a strange world where people share numerous deformities, the same problem we all face challenges each of them: to find someone who accepts you as you are. Sometimes, that means finding yourself first.','ht