ments they used to terrify their audiences, and previously unreleased footage including make-up tests and deleted scenes.','https://image.tmdb.org/t/p/w500/yEWDfJWhFuR77jlntpFGKssKLeT.jpg','1998-06-13',7.2,0),(25477,'The Getaway','en','A recently released ex-convict and his loyal wife go on the run after a heist goes wrong.','https://image.tmdb.org/t/p/w500/cejCUq2Z2NG8alizTp6ZJVwEDmo.jpg','1972-09-20',7.1,0),(25478,'Into the Sun','en','After the assassination of Tokyo\'s Governor by Yakuza members, the CIA bureau chief (William Atherton) for Tokyo puts out a call to an agent (Steven Seagal) that had been raised in Japan and trained by ex-Yakuza. Using his former ties, he quickly determines that a war is brewing between old-guard Yakuza members and a young, crazed leader (Takao Osawa) with ties to the Chinese Tong.','https://image.tmdb.org/t/p/w500/rrfGzNwsIycS8uQZ9eb0iJhPbgs.jpg','2005-11-26',4.4,0),(25479,'Heavy Trip','fi','Turo is stuck in a small village and the best thing in his life is being the lead vocalist for the amateur metal band Impaled Rektum. He and his bandmates have practiced for 12 years without playing a single gig. The guys get a surprise visitor from Norway -- the promoter for a huge heavy metal music festival -- and decide it\'s now or never. They steal a van, a corpse, and even a new drummer to make their dreams a reality.','https://image.tmdb.org/t/p/w500/iemwek3NFkcsEqTXGHg8xsjXzAk.jpg','2018-03-09',6.8,0),(25480,'The Prey','fr','A robber escapes from prison with a single objective in mind: to track down his former cellmate, a serial killer who intends to pin his crimes on him. A cop is sent after the robber who, despite his best efforts, soon becomes Public Enemy Number One. As the protagonists are driven to their limits, it becomes increasingly unclear who is the hunter and who is the prey.','https://image.tmdb.org/t/p/w500/vv30WTTkdstFcOW82EigWQNBHik.jpg','2011-04-12',6.3,0),(25481,'The Railway Children Return','en','Follow a group of children who are evacuated to a Yorkshire village during the Second World War, where they encounter a young soldier who, like them, is far away from home.','https://image.tmdb.org/t/p/w500/7tp7UaCM8kibj2WRnyOmHXJQVGI.jpg','2022-07-15',6.8,0),(25482,'Dhoom 2','hi','Jai and Ali return, this time on the trail of an international thief who steals priceless artifacts and has chosen Mumbai as his next target.','https://image.tmdb.org/t/p/w500/3zJLnrP9g9LSMpX5C1wau49gGUv.jpg','2006-11-24',6.6,0),(25483,'Demons','it','A group of people are trapped in a West Berlin movie theater infested with ravenous demons who proceed to kill and possess the humans one-by-one, thereby multiplying their numbers.','https://image.tmdb.org/t/p/w500/h1icFFIehFjZOpzl6xueBeJYMXe.jpg','1985-10-04',6.6,0),(25484,'¿Nos casamos? Sí, mi amor','es','Guille decides it\'s time to take the next step and proposes to his girlfriend Bea, but things get complicated and nothing goes as planned.','https://image.tmdb.org/t/p/w500/AihFo8adZ6piwWpS3qvNxaUlTFU.jpg','2022-02-03',3.3,0),(25485,'Blunt Force Trauma','en','Follows the journey of John and Colt, gunfighters and sometime lovers, on parallel but very different journeys through an underground dueling culture.','https://image.tmdb.org/t/p/w500/7fGGcl2yZw3aUfHoOVR7LecU0OZ.jpg','2015-10-05',5.2,0),(25486,'Marvel Studios: Assembling a Universe','en','A look at the story behind Marvel Studios and the Marvel Cinematic Universe, featuring interviews and behind-the-scenes footage from all of the Marvel films, the Marvel One-Shots and \"Marvel\'s Agents of S.H.I.E.L.D.\"','https://image.tmdb.org/t/p/w500/41Ke02UzYoPsiTc3YbomPGiQKMl.jpg','2014-03-18',7,0),(25487,'Arthur','en','A drunken playboy stands to lose a wealthy inheritance when he falls for a woman that his family doesn\'t like.','https://image.tmdb.org/t/p/w500/foUTAJurvnbUoIUbnuUk5dyHx7M.jpg','2011-04-08',5.6,0),(25488,'The Vast of Night','en','At the dawn of the space-race, two radio-obsessed teens discover a 