r.','https://image.tmdb.org/t/p/w500/Am3avSjCB9y7fmqwFY8qIatPpYi.jpg','2019-05-02',8,0),(25494,'The Spacewalker','ru','March 1965. In the heat of the Cold War, the USA and the USSR are competing for supremacy in space. What both superpowers aim for in this race, is to be the first to have a man walk in outer space. To accomplish that, no price is too high and no risk is too great. Now it’s up to the unlikely duo of a seasoned war veteran and a hot-headed test-pilot to fulfill this mission. Two men in a tiny spaceship, without proper testing, facing the complete unknown. They were supposed to do what no man has done before—and no man imagined what would happen next.','https://image.tmdb.org/t/p/w500/hDNVRmrprxI9NQ0zc2Uu03p65Fw.jpg','2017-04-09',7.1,0),(25495,'Less Than Zero','en','A college freshman returns to Los Angeles for Christmas at his ex-girlfriend\'s request, but discovers that his former best friend has an out-of-control drug habit.','https://image.tmdb.org/t/p/w500/qOSIUN0eQCLwL5CuEm8UGi9p2zq.jpg','1987-11-06',6.4,0),(25496,'The Four Musketeers','en','The Four Musketeers defend the queen and her dressmaker from Cardinal Richelieu and Milady de Winter.','https://image.tmdb.org/t/p/w500/dm0ArEYWrrfyOkMUbKOE8ZnCc92.jpg','1974-10-31',6.4,0),(25497,'Love Story','en','Harvard Law student Oliver Barrett IV and music student Jennifer Cavilleri share a chemistry they cannot deny - and a love they cannot ignore. Despite their opposite backgrounds, the young couple put their hearts on the line for each other. When they marry, Oliver\'s wealthy father threatens to disown him. Jenny tries to reconcile the Barrett men, but to no avail.','https://image.tmdb.org/t/p/w500/yCjADq9fwbdPnxMo0DKNeRGZ4YC.jpg','1970-12-16',6.8,0),(25498,'You Are the Apple of My Eye','zh','A group of close friends who attend a private school all have a debilitating crush on the sunny star pupil, Shen Jiayi. The only member of the group who claims not to is Ke Jingteng, but he ends up loving her as well.','https://image.tmdb.org/t/p/w500/mQ07Y4KlYZlJjVSEp2AFTYZA9i.jpg','2011-08-19',7.4,0),(25499,'The Thirteenth Floor','en','Los Angeles. A wealthy man, known as Mr. Fuller, discovers a shocking secret about the world he lives in. Fearing for his life, he leaves a desperate message for a friend of his in the most unexpected place.','https://image.tmdb.org/t/p/w500/7oaie3ZBc9UuWZLF24crro1pone.jpg','1999-04-16',7,0),(25500,'An American Tail','en','A young mouse named Fievel and his family decide to migrate to America, a \"land without cats,\" at the turn of the 20th century. But somehow, Fievel ends up in the New World alone and must fend off not only the felines he never thought he\'d have to deal with again but also the loneliness of being away from home.','https://image.tmdb.org/t/p/w500/wjhUy9af89vc9CviKcPgTNTrmIq.jpg','1986-11-21',6.7,0),(25501,'Mother','es','A pregnant woman, who is taking care of her son with development problems, is at her breaking point when a caregiver from the Philippines steps into her life. Diana suspects that she’s using voodoo against her after the quick improvements of her son.','https://image.tmdb.org/t/p/w500/zNJXC50PXEAuOG9zI87zyy4SBGL.jpg','2016-05-01',6.5,0),(25502,'Whale Rider','en','On the east coast of New Zealand, the Whangara people believe their presence there dates back a thousand years or more to a single ancestor, Paikea, who escaped death when his canoe capsized by riding to shore on the back of a whale. From then on, Whangara chiefs, always the first-born, always male, have been considered Paikea\'s direct descendants. Pai, an 11-year-old girl in a patriarchal New Zealand tribe, believes she is destined to be the new chief. But her grandfather Koro is bound by tradition to pick a male leader. Pai loves Koro more than anyone in the world, but she must fight him and a thousand years of tradition to fulfill her destiny.','https://image.tmdb.org/t/p/w500/1ZQSkyEDRJdk6TCAThBojB5hJcK.jpg','2003-01-30',7.2,0),(25503,'The 