 Canyon when he was a belligerent, trailer park-raised eight-year-old. Now, blasting Van Halen in his jacked-up economy car, the irrepressibly optimistic Joe hits the road alone in search of his folks.','https://image.tmdb.org/t/p/w500/nQoZBpLqGydDjVRXILTx06DoLCF.jpg','2001-04-10',5.6,0),(25510,'The War with Grandpa','en','Peter is thrilled that his Grandpa is coming to live with his family. That is, until Grandpa moves into Peter\'s room, forcing him upstairs into the creepy attic. And though he loves his Grandpa, he wants his room back - so he has no choice but to declare war.','https://image.tmdb.org/t/p/w500/ltyARDw2EFXZ2H2ERnlEctXPioP.jpg','2020-08-27',6.5,0),(25511,'Wishmaster 3: Beyond the Gates of Hell','en','The evil Djinn is back at again, this time wreaking havoc on the students of Illinois\' Baxter University. His victim is a beautiful, innocent and studious teenage girl named Diana Collins who accidentally opened up the Djinn\'s tomb and released him.','https://image.tmdb.org/t/p/w500/aQaOymRoRpNBFOaFRnoxXj6dwJv.jpg','2001-10-23',4.5,0),(25512,'Chilangolandia','es','Mexico City, or \"Chilangolandia,\" is a chaotic metropolis where millions of stories take place every day. Some of them are part of this fun comedy full of familiar characters and others that defy stereotypes. Ramiro is a taxi driver who hopes his problems will end when his nephew \"El Chulo\" becomes a national soccer star. On the other hand, Carmen and Miguel are couple who unexpectedly receive a suitcase with a large sum of money, just what they need to get out of their financial situation. But when the true owners of the cash realize that it fell into the wrong hands, endless adventures and misunderstandings break out within this complex city.','https://image.tmdb.org/t/p/w500/gNObb3Q1P2yO2Z14bs6AXx0cWVy.jpg','2021-09-16',7.2,0),(25513,'Hunter Hunter','en','A fur trapper leaves his wife and daughter behind to kill a rogue wolf in the remote wilderness, but they soon become increasingly worried when their peaceful existence is disrupted.','https://image.tmdb.org/t/p/w500/j52lKBGoHGmUJNUMsDV5kHOkMfC.jpg','2020-12-18',6.5,0),(25514,'Rock-A-Doodle','en','Chanticleer is a foolhardy farm rooster who believes his crows can actually make the sun come up and shine. When the sun rises one morning without Chanticleer\'s crow, he leaves the farm in disgrace and runs off to become a rock \'n\' roll singer. But in his absence, a sinister, sunshine-hating owl prepares to take over.','https://image.tmdb.org/t/p/w500/q5xSS8MNmrwR3em6VB6OC3992d6.jpg','1991-08-02',6.2,0),(25515,'Milada','en','The story of communist show-trial victim Milada Horáková. Horáková was one of the first victims of the communist regime in Czechoslovakia. She opposed the communist coup in 1948 but did not leave the country. She was arrested and tried for treason on fabricated charges in a show trial that was broadcast on the radio and shown in film clips. The film focuses on the time from 1945 to 1950 when the communists took over, but also goes back a little further in Horáková\'s life into the late 1930s','https://image.tmdb.org/t/p/w500/uGY9mRnDY8p1XuTZs0OG4trPwAK.jpg','2017-11-02',6.9,0),(25516,'Alien Outbreak','en','In a small rural community, local police officers Zoe and Patrick begin their shift as normal but soon, strange events unfold. Residents begin behaving erratically, and suicidal panic spreads amongst the township they are trying to protect. Zoe and Patrick realise alien machines are taking hold, cutting their small group of survivors off from the outside world. Can the determined humans band together to save their community, and all mankind, from extinction?','https://image.tmdb.org/t/p/w500/5m4Gw9wTRxUdDnx7UNn1bNLN54J.jpg','2020-02-11',3.9,0),(25517,'The Fanatic','en','A rabid film fan stalks his favorite action hero and destroys the star\'s life.','https://image.tmdb.org/t/p/w500/nojx83s8JWyYpI9oeKdQXniWMu6.jpg','2019-08-30',4.5,0),(25518,'Bubba Ho-tep','en','Bubba Ho-tep tells the \"true\" story of what really did become of Elvis Presley. We find Elvis as an elderly resident in an East Texas rest home, who switched identities with an Elvis impersonator years before his \"death,\" then missed his chance to switch back. He must team up with JFK and fight an ancient Egyptian mummy for the souls of their fellow residents.','https://image.tmdb.org/t/p/w500/61S9pzoX75UxP3ko6e8aTitu7MW.jpg','2002-06-09',6.6,0),(25519,'Reasonable Doubt','en','When up-and-coming District Attorney Mitch Brockden commits a fatal hit-and-run, he feels compelled to throw the case against the accused criminal who was found with the body and blamed for the crime. Following the trial, Mitch\'s worst fears come true when he realizes that he acquitted a guilty man, and he soon finds himself on the hunt for the killer before more victims pile up.','https://image.tmdb.org/t/p/w500/n0BUpxa6E8PYoZWbx5g6CxbdalX.jpg','2014-01-17',5.8,0),(25520,'A Fairy Tale After All','en','A stubborn teenage girl finds herself confronted by whimsical characters when she is transported into a world of fantasy and fairy tales while attending a school marionette show.','https://image.tmdb.org/t/p/w500/uXq56XNfgRgBdCW65K6goiMUr3o.jpg','2022-02-18',6.3,0),(25521,'Proud Mary','en','Mary is a hit woman working for an organized crime family in Boston, whose life is completely turned around when she meets a young boy whose path she crosses when a professional hit goes bad.','https://image.tmdb.org/t/p/w500/5luceoVMU2FzWuyty7mZFcSY5ZW.jpg','2018-01-12',5.4,0),(25522,'Top Secret!','en','Popular and dashing American singer Nick Rivers travels to East Germany to perform in a music festival. When he loses his heart to the gorgeous Hillary Flammond, he finds himself caught up in an underground resistance movement. Rivers joins forces with Agent Cedric and Flammond to attempt the rescue of her father, Dr. Paul, from the Germans, who have captured the scientist in hopes of coercing him into building a new 