hake the foundations of the Catholic Church.','https://image.tmdb.org/t/p/w500/4d4mTSfDIFIbUbMLUfaKodvxYXA.jpg','2019-11-27',7.5,0),(25528,'David and Goliath','en','The big-budget, epic film on young King David who took on the mighty warrior Goliath against all odds.','https://image.tmdb.org/t/p/w500/a8ZE7AJO1UchOGCLe2nLR61HOpN.jpg','2015-03-13',6,0),(25529,'I Am Wrath','en','A man is out for justice after a group of corrupt police officers are unable to catch his wife\'s killer.','https://image.tmdb.org/t/p/w500/6NvLA3BP5ktLaZ1qdLY0oHsaqwD.jpg','2016-04-14',5.6,0),(25530,'The Death and Life of Bobby Z','en','A DEA agent provides former Marine Tim Kearney with a way out of his prison sentence: impersonate Bobby Z, a recently deceased drug dealer, in a hostage switch with a crime lord. When the negotiations go awry, Kearney flees, with Z\'s son in tow.','https://image.tmdb.org/t/p/w500/sgIthxRLUBTbaetVXvXwQEmbfn2.jpg','2007-07-23',6.2,0),(25531,'Can You Ever Forgive Me?','en','When a bestselling celebrity biographer is no longer able to get published because she has fallen out of step with current tastes, she turns her art form to deception.','https://image.tmdb.org/t/p/w500/hPuZR2bFoV0kuBrA98exWyvTf40.jpg','2018-10-19',6.8,0),(25532,'The Sessions','en','Though a childhood bout with polio left him dependent on an iron lung, Mark O\'Brien maintains a career as a journalist and poet. A writing assignment dealing with sex and the disabled piques Mark\'s curiosity, and he decides to investigate the possibility of experiencing sex himself. When his overtures toward a caregiver scare her away, he books an appointment with sex surrogate Cheryl Green to lose his virginity.','https://image.tmdb.org/t/p/w500/57o1DBc5DfJXVc8wArAblSbZ8sD.jpg','2012-05-02',6.9,0),(25533,'Flower','en','Rebellious, quick-witted Erica Vandross is a 17-year-old firecracker living with her single mom, Laurie, and her mom\'s new boyfriend, Bob, in L.A.\'s San Fernando Valley. When Bob\'s mentally unbalanced son, Luke, arrives from rehab to live with the family, Erica finds her domestic and personal life overwhelmed. With Luke and her sidekicks Kala and Claudine in tow, Erica acts out by exposing a high school teacher\'s dark secret.','https://image.tmdb.org/t/p/w500/xYTI11qFnmx39LRhDOsGEabfqtp.jpg','2017-03-16',6.5,0),(25534,'The Woman in Red','en','When a happily married family man, who would never consider an affair, meets a beautiful woman in red, he is totally infatuated and desperate to make her acquaintance. However, as he tries out various schemes to sneak out to meet her, he realizes that adultery is not quite as easy as it looks.','https://image.tmdb.org/t/p/w500/4cBhKj5wVEyJdXwZfxHB1E4P749.jpg','1984-08-15',6.2,0),(25535,'Can\'t Live Without You','es','A gay gym teacher wants to be a father and when his boyfriend\'s sister, a former addict, comes back on the scene there is now a possible solution.','https://image.tmdb.org/t/p/w500/fF6OT1BBCNnqXaMj8P60oksivZz.jpg','2022-06-03',5.9,0),(25536,'Wild Target','en','Victor Maynard is a middle-aged, solitary assassin who lives to please his formidable mother, despite his own peerless reputation for lethal efficiency. His professional routine is interrupted when he finds himself drawn to one of his intended victims. After sparing her life, he unexpectedly acquires a young apprentice. Believing Victor to be a private detective, his two new companions tag along, while he attempts to thwart the murderous attentions of his unhappy client.','https://image.tmdb.org/t/p/w500/ejKD5DQ7jouzEkz1fx5Fr8li2ZA.jpg','2010-06-17',6.4,0),(25537,'Mercy','en','A single mom and her two boys help take care of their grandmother with mystical powers.','https://image.tmdb.org/t/p/w500/qw7FkjLxsDj5vmBk04L2dkiJopo.jpg','2014-10-07',5,0),(25538,'Employee of the Month','en','\"Employee of the Month\" is about a guy whose day spirals from bad to worse when he gets fired from his dream job at the bank and is dumped by his fiancée Sara. David\