lfriend May and his dream of owning a motorcycle. Brandon\'s best friend is Michael, an ambitious and murderous dope peddler. Michael covets May and so he comes up with a plan that will win her for him, and solves a problem he\'s been having. It seems that an undercover cop named Sharky has been using his police connections to dominate the local cocaine trade, so Michael has him killed and uses Brandon as the fall guy. Brandon goes to jail, though he thinks that he will be released soon thanks to the efforts of his good buddy Michael. Eight years later Brandon finally gets out of jail and vows revenge.','https://image.tmdb.org/t/p/w500/49NJow1LLJaLNTlailOU1UiNG6r.jpg','1986-12-20',7.5,0),(25544,'Summerland','en','A woman during the Second World War opens her heart to an evacuee after initially resolving to be rid of him.','https://image.tmdb.org/t/p/w500/owfKp0rbBa8vHoNO30MdB3GiaYU.jpg','2020-07-24',7.6,0),(25545,'Checkered Ninja 2','da','After Phillip Eppermint manages to evade a prison sentence in Thailand, Checkered Ninja comes alive and seeks out Alex. Together, with Alex and his entire family, they now have to go to Thailand to bust Eppermint.','https://image.tmdb.org/t/p/w500/fjWiVF2vFwd3mhs1dNoS0SOHxqt.jpg','2021-08-19',6.6,0),(25546,'The English Teacher','en','Teacher Linda Sinclair balances her staid home life with an incredible passion for her subject, but her routine is forever altered when a former star pupil and his unsupportive father reenter her life.','https://image.tmdb.org/t/p/w500/mF14chZNzgDRZffs8Wk8lPwdNQA.jpg','2013-05-16',5.6,0),(25547,'One-Eyed Jacks','en','Running from the law after a bank robbery in Mexico, Dad Longworth finds an opportunity to take the stolen gold and leave his partner Rio to be captured. Years later, Rio escapes from the prison where he has been since, and hunts down Dad for revenge. Dad is now a respectable sheriff in California, and has been living in fear of Rio\'s return.','https://image.tmdb.org/t/p/w500/xal47bRKVIxE