ina, and get him to Israel to be judged.','https://image.tmdb.org/t/p/w500/nlIdPeH5IrR1qRErschnVQeZAQu.jpg','2018-08-29',6.7,0),(25555,'Deck the Halls','en','Determined to unseat Steve Finch\'s reign as the town\'s holiday season king, Buddy Hall plasters his house with so many decorative lights that it\'ll be visible from space! When their wives bond, and their kids follow suit, the two men only escalate their rivalry - and their decorating.','https://image.tmdb.org/t/p/w500/muRplVEe8xU1jVlq9WpQSOamb6s.jpg','2006-11-22',5.5,0),(25556,'Dangerous Liaisons','en','In 18th century France, Marquise de Merteuil asks her ex-lover Vicomte de Valmont to seduce the future wife of another ex-lover of hers in return for one last night with her. Yet things don’t go as planned.','https://image.tmdb.org/t/p/w500/5MEl1xrbM93zjpFgS3sHJ2SlIFm.jpg','1988-12-21',7.3,0),(25557,'Splitting Adam','en','After accidentally stumbling into his uncle\'s mysterious \"tanning bed\", Adam learns the answer to all of his problems - multiple Adams. With his new collection of clones, Adam is hopping on one wild summer ride with an epic splash.','https://image.tmdb.org/t/p/w500/Ak40eOsh7MK466eJmoIUMwNEWON.jpg','2015-02-16',6.8,0),(25558,'The Lady from Shanghai','en','A romantic drifter gets caught between a corrupt tycoon and his voluptuous wife.','https://image.tmdb.org/t/p/w500/whqdqWavNMSoeXTx1X3DauO1LG6.jpg','1947-12-24',7.4,0),(25559,'Young Ip Man: Crisis Time','zh','In 1917 young Ip Man first came to Hong Kong to study, but his peaceful campus life was unexpectedly broken. A shocking hostage situation occurred on the day when the school held an English speech contest. All students in the school were held hostage, and one person was killed every minute. Facing the immediate crisis, Ip Man stepped forward, but unexpectedly discovered that the kidnapper was his master, and his good brother turned out to be an accomplice of the kidnapper.','https://image.tmdb.org/t/p/w500/pRO441hhosf6lt4OWetBRQw6k8a