HfS6Gr.jpg','1979-08-10',5.1,0),(25605,'Cat on a Hot Tin Roof','en','An alcoholic ex-football player drinks his days away, having failed to come to terms with his sexuality and his real feelings for his football buddy who died after an ambiguous accident. His wife is crucified by her desperation to make him desire her: but he resists the affections of his wife. His reunion with his father—who is dying of cancer—jogs a host of memories and revelations for both father and son.','https://image.tmdb.org/t/p/w500/vWf1AR8rC6WjGKELlmLv2VAUZJB.jpg','1958-08-29',7.7,0),(25606,'The Warriors Gate','km','After a mysterious chest opens a gateway through time, teen gamer Jack is transported to an ancient empire terrorized by a cruel barbarian king. Jack will need all of his gaming skills as he battles to defeat the barbarian, protect a beautiful princess, and somehow find his way back home.','https://image.tmdb.org/t/p/w500/tordvGaBjmoANX6nMpeDdgvy4g3.jpg','2016-11-18',6.6,0),(25607,'Don\'t Look Back','fr','Panic attacks and memory loss signal the plight of a writer whose body is inexplicably being taken over by another woman.','https://image.tmdb.org/t/p/w500/jPcOn2JyFFcWNbsRME8hXkvmMRT.jpg','2009-06-03',5.6,0),(25608,'Crazy About Her','es','After a magical night together, Adri voluntarily turns himself into the psychiatric institution where Carla lives.','https://image.tmdb.org/t/p/w500/hPBJckYsL1UOsz44InZ2wYJyJTy.jpg','2021-02-26',7.2,0),(25609,'No Thanks','fi','Heli Valkonen is desperately in love with her husband. But Matti is just not in the mood. He is only interested in playing computer games, dressed in worn out fleece pants. For him, a shoulder massage is the highest form of intimacy. When subtle hints, nice words and fetching clothes won\'t help, Heli resorts in direct, and increasingly direct action - in vain.','https://image.tmdb.org/t/p/w500/qCJMOVMeTQ6I6XVcNNuZ0XmRos7.jpg','2014-01-10',4.8,0),(25610,'Ang Lihim Ni Antonio','en','The story about a teenage boy, Antonio, whose emerging gay sexuality alienates him from his friends and family, until his libertine uncle, Jonbert, comes to live with him and his mother...','https://image.tmdb.org/t/p/w500/jRR7ZyYsfF12NZMmzyMoNEqA83J.jpg','2008-02-13',5.8,0),(25611,'Blow Out','en','Jack Terry is a master sound recordist who works on grade-B horror movies. Late one evening, he is recording sounds for use in his movies when he hears something unexpected through his sound equipment and records it. Curiosity gets the better of him when the media become involved, and he begins to unravel the pieces of a nefarious conspiracy. As he struggles to survive against his shadowy enemies and expose the truth, he does not know whom he can trust.','https://image.tmdb.org/t/p/w500/weMW1wLzeagP3tw6BfmYf1iL7dz.jpg','1981-07-24',7.3,0),(25612,'Snow Dogs','en','When a Miami dentist inherits a team of sled dogs, he\'s got to learn the trade or lose his pack to a crusty mountain man.','https://image.tmdb.org/t/p/w500/rIPJRJZGleNaK1kfHBaFbGZ675m.jpg','2002-01-18',5.6,0),(25613,'Nine','en','Arrogant, self-centered movie director Guido Contini finds himself struggling to find meaning, purpose, and a script for his latest film endeavor. With only a week left before shooting begins, he desperately searches for answers and inspiration from his wife, his mistress, his muse, and his mother.','https://image.tmdb.org/t/p/w500/zSXVI01jUCt6bvcbUSjHlTtnWgE.jpg','2009-12-03',5.5,0),(25614,'Boy Erased','en','Jared, the son of a Baptist pastor in a small American town, is outed to his parents at age 19. Jared is faced with an ultimatum: attend a gay conversion therapy program – or be permanently exiled and shunned by his family, friends, and faith.','https://image.tmdb.org/t/p/w500/oZbhTdi0ZQY7iiSQ0L7h3ya6NDF.jpg','2018-09-24',7,0),(25615,'Don\'t Look Now','en','Laura and John, grieved by a terrible loss, meet in Venice, where John is in charge of the restoration of a church, two mysterious sisters, one of whom gives them a message sent from the afterlife.','https://image.tmdb.org/t/p/w500/vIftm9VI0xhiIFEq7dV4YfpTvBb.jpg','1973-12-03',7,0),(25616,'Hondo','en','Army despatch rider Hondo Lane discovers a woman and her son living in the midst of warring Apaches, and he becomes their protector.','https://image.tmdb.org/t/p/w500/xgdEI4FacNSZw4JLqDDwqs5sAeK.jpg','1953-11-27',6.7,0),(25617,'Free Fall','de','A promising career with the police, a baby on the way... Marc\'s life seems to be right on track. Then he meets fellow policeman Kay and during their regular jogs Marc experiences a never-before-felt sense of ease and effortlessness -- and what it means to fall in love with another man.','https://image.tmdb.org/t/p/w500/utZcONU4ZIuQJJFA12i8RcNriKF.jpg','2013-05-27',7.7,0),(25618,'Falling in Love','en','During shopping for Christmas, Frank and Molly run into each other. This fleeting short moment will start to change their lives, when they recognize each other months later in the train home and have a good time together. Although both are married and Frank has two little kids, they meet more and more often, their friendship becoming the most precious thing in their lives.','https://image.tmdb.org/t/p/w500/c8Ti4tOwAmY6RhUxV9JsXl2W4l7.jpg','1984-11-21',6.7,0),(25619,'Aguirre, the Wrath of God','de','A few decades after the destruction of the Inca Empire, a Spanish expedition led by the infamous Aguirre leaves the mountains of Peru and goes down the Amazon River in search of the lost city of El Dorado. When great difficulties arise, Aguirre’s men start to wonder whether their quest will lead them to prosperity or certain death.','https://image.tmdb.org/t/p/w500/6MNqmGe0JjEuGX1PMjRBAEI6aXg.jpg','1972-12-29',7.5,0),(25620,'The Front Runner','en','Gary Hart, former Senator of Colorado, becomes the front-runner for the Democratic presidential nomination in 1987. Hart\'s intelligence, charisma and idealism makes him popular with young voters, leaving him with a seemingly clear path to the White House. All that comes crashing down when allegations of an extramarital affair surface in the media, forcing the candidate to address a scandal that threatens to derail his campaign and personal life.','https://image.tmdb.org/t/p/w500/9QKzd31H1bCjMAJ8HoaASWqbHfY.jpg','2018-11-06',5.9,0),(25621,'All Is Lost','en','During a solo voyage in the Indian Ocean, a veteran mariner awakes to find his vessel taking on water after a collision with a stray shipping container. With his radio and navigation equipment disabled, he sails unknowingly into a violent storm and barely escapes with his life. With any luck, the ocean currents may carry him into a shipping lane -- but, with supplies dwindling and the sharks circling, the sailor is forced to face his own mortality.','https://image.tmdb.org/t/p/w500/9cVA4oX2xHgiglv6hemxwAaofsq.jpg','2013-08-23',6.6,0),(25622,'Victor/Victoria','en','A struggling female soprano finds work playing a male female impersonator, but it complicates her personal life.','https://image.tmdb.org/t/p/w500/u1aMgr6pcMJ486IgEXRY3YYsHIK.jpg','1982-04-25',7.3,0),(25623,'The Fury','en','When a devious plot separates CIA agent Peter Sandza from his son, Robin, the distraught father manages to see through the ruse. Taken because of his psychic abilities, Robin is being held by Ben Childress, who is studying people with supernatural powers in hopes of developing their talents as weapons. Soon Peter pairs up with Gillian, a teen who has telekinesis, to find and rescue Robin.','https://image.tmdb.org/t/p/w500/cQCxG3TDaFi34HdKgaa1lhv8wXJ.jpg','1978-03-10',6.3,0),(25624,'Thieves and Robbers','it','LAPD Captain Parker finally is going on Holiday with all his family. At the last moment he has to cancel the program to re-capture a pilferer named Tony Roma, bad copy of a Latin lover. He use to seduce older women and then steals their jewelry. Parker is close to sort the case out when Roma is witness of a Mafia murder. Parker Holiday flies away.','https://image.tmdb.org/t/p/w500/zs81YnizFSwcNZHxUyCY7CCjSH5.jpg','1983-02-11',6.3,0),(25625,'Boys and Girls','en','Ryan and Jennifer are opposites who definitely do not attract. At least that\'s what they always believed. When they met as twelve-year-olds, they disliked one another. When they met again as teenagers, they loathed each other. But when they meet in college, the uptight Ryan and the free-spirited Jennifer find that their differences bind them together and a rare friendship develops.','https://image.tmdb.org/t/p/w500/9zmvYVgcdoXPZQE44gN7nKHScD4.jpg','2000-06-16',6,0),(25626,'True Legend','zh','Su Qi-Er, a wealthy man living during the Qing Dynasty who loses his fortune and reputation as a result of a conspiracy against him. After being forced out onto the streets, Su dedicates his life to martial arts and reemerges as a patriotic hero known as the \"King of Beggars.\"','https://image.tmdb.org/t/p/w500/6UICxESwvJbvRHdgT0jenH1xPmW.jpg','2010-02-09',6.6,0),(25627,'Le Chef','fr','A veteran chef faces off against his restaurant group\'s new CEO, who wants to the establishment to lose a star from its rating in order to bring in a younger chef who specializes in molecular gastronomy.','https://image.tmdb.org/t/p/w500/752BCNz9uFiym29bqIsyOaPAln5.jpg','2012-03-07',6.2,0),(25628,'Kung Fu League','zh','A poor comic book artist summons four legendary Kung Fu masters to learn the highest level of martial arts and help him get his girl.','https://image.tmdb.org/t/p/w500/45xvNQA6hbDRX6eIJ4CZqhtbxTh.jpg','2018-10-19',5.6,0),(25629,'The Cider House Rules','en','Homer is an orphan who was never adopted, becoming the favorite of orphanage director Dr. Larch. Dr. Larch imparts his full medical knowledge on Homer, who becomes a skilled, albeit unlicensed, physician. But Homer yearns for a self-chosen life outside the orphanage. What will Homer learn about life and love in the cider house? What of the destiny that Dr. Larch has planned for him?','https://image.tmdb.org/t/p/w500/8Fr402A5aOS9JLK0Ll8C0QDcgwm.jpg','1999-12-17',7,0),(25630,'The Sword and the Sorcerer','en','A mercenary with a three-bladed sword rediscovers his royal heritage when he is recruited to help a princess foil a brutal tyrant and a powerful sorcerer\'s plans to conquer the land.','https://image.tmdb.org/t/p/w500/3804sBcpgNvpNpLc53hb4MMB6f7.jpg','1982-04-01',5.5,0),(25631,'On a Magical Night','fr','After 20 years of marriage, Maria decides to leave her husband. She moves into room 212 at the hotel across the street, with a bird’s-eye view of her apartment, her husband and the life she shared with him. While she wonders if she made the right decision, many of the people in her life offer their opinions on the matter. They intend to let her know, whether she likes it or not, on what proves to be a life-changing evening.','https://image.tmdb.org/t/p/w500/l44RScRCr5AJJtonRatFgmOFRZ0.jpg','2019-10-09',6.3,0),(25632,'Babysitting 2','fr','Franck and his girlfriend Sonya, plus some of their friends go on holiday in Brazil. Franck, his friends, two girls and Sonya\'s grandmother leave to visit a cave, but everything goes wrong and their crazy adventures begin.','https://image.tmdb.org/t/p/w500/8kDHjMLw5knh0AYdp9iIeUt5AYZ.jpg','2015-12-02',6.3,0),(25633,'The Thousand Faces of Dunjia','zh','The world is on the brink of catastrophe in a chaotic age where evil demons roam. In order to keep evil at bay, a mysterious organisation from the pugilist world emerges. A new constable and a young girl with a mysterious past are also drawn into this group, and the group embarks on an incredible adventure.','https://image.tmdb.org/t/p/w500/uoRMxeDW5vD6u9EDbE1dwUV70Lu.jpg','2017-12-15',6.2,0),(25634,'Mimic 2','en','When a cockroach-spread plague threatened to decimate the child population of New York City in the original Mimic, biologist Susan Tyler and her research associates developed a species of \"Judas\" bugs and introduced them into the environment, where they were to \"mimic\" the diseased roaches and infiltrate their grubby habitats. The plan worked until the bugs evolved to mimic their next prey... humans! Just when they were all thought to be dead, the giant cockroaches are back, and this time they\'ve mutated to take on human form!','https://image.tmdb.org/t/p/w500/13tSI83ucR7XuQcr7muAjNIgH91.jpg','2001-07-17',5.3,0),(25635,'Dreamgirls','en','A trio of female soul singers cross over to the pop charts in the early 1960s, facing their own personal struggles along the way.','https://image.tmdb.org/t/p/w500/sG5JyOj8Spe13QkNJMH8b5kzQUh.jpg','2006-12-25',6.8,0),(25636,'Operation Varsity Blues: The College Admissions Scandal','en','An examination that goes beyond the celebrity-driven headlines and dives into the methods used by Rick Singer, the man at the center of the shocking 2019 college admissions scandal, to persuade his wealthy clients to cheat an educational system already designed to benefit the privileged.','https://image.tmdb.org/t/p/w500/qZJuctnatinO0OpnruGOWaT4Bga.jpg','2021-03-17',7,0),(25637,'Island of Fire','en','Someone in a prison run by a corrupt warden fakes the deaths of convicts to later use them as expendable assassins. A police officer is sent into the prison to gather evidence of the corruption.','https://image.tmdb.org/t/p/w500/l9MPPqbWGkIMJnp177Wk4AxGtx8.jpg','1990-03-28',6.2,0),(25638,'Lost Souls','en','A young woman becomes aware of a conspiracy to enable the Devil to walk the Earth in human form. To defeat the prophesy, she must convince a respected New York crime journalist, who is devoid of faith, that he is in fact the target of the conspiracy.','https://image.tmdb.org/t/p/w500/qmplwqJqjbWLFf1n1VQSemmR7EB.jpg','2000-10-13',5.1,0),(25639,'North Wind: Broken Time','zh','China’s booming animation industry has reached us. The film in question is Shuo Feng — Po Zhen Zi, an action epic directed by Zheng Wu and based on an internet novel by A Nu.  From what we understand, the film is set in the eighth century, during China’s Tang dynasty. The story draws inspiration from real historical battles, which pitted Chinese forces against the Islamic Abbasid Caliphate and Tibetan Empire in Central Asia. Watch the hyper-kinetic, elaborately composited trailer below:','https://image.tmdb.org/t/p/w500/m2Io7ygz7ItdXMmCid8CdKcZiGE.jpg','2020-09-17',0,0),(25640,'Memories of My Father','es','In the polarized and violent Medellín (Colombia\'s \'City of Eternal Spring\') of the 1970s, doctor Héctor Abad Gómez is concerned about both his children and children from less favored classes. After a devastating loss in the family, Héctor gives himself to the greater cause of public health programs for the poor in Medellín to the consternation of the city\'s authorities.','https://image.tmdb.org/t/p/w500/f816T5jzypMqoTQiNCBrrG99Uoa.jpg','2020-08-22',7.7,0),(25641,'Children of the Corn','en','Set primarily in 1975 in the fictional town of Gatlin, Nebraska this remake of the 1984 original (based on Stephen King\'s 1977 short story) centers around traveling couple Burt and Vicky as they fight to survive a cult of murderous children who worship an entity known as He Who Walks Behind The Rows, which had years earlier manipulated the children into killing every adult in town.','https://image.tmdb.org/t/p/w500/fO3DRzEDMXzHErgNrvr2gMlpMWC.jpg','2009-09-26',4.5,0),(25642,'El señor de los cielos II','es','','https://image.tmdb.org/t/p/w500/hwlyXL9sud1HFBRe1nnUd6Ltzzs.jpg','1998-12-31',3.5,0),(25643,'Demolition','en','An emotionally desperate investment banker finds hope through a woman he meets.','https://image.tmdb.org/t/p/w500/4t56LZ1KbOOxgKfqMKN6truBDVc.jpg','2015-04-08',6.8,0),(25644,'Emmanuelle: First Contact','en','Emmanuelle makes first contact...when a group of intergalactic travelers arrives, seeking to understand human love and sexuality. Who better to teach them than Emmanuelle, the most sensual woman in the world...and beyond.','https://image.tmdb.org/t/p/w500/7aBSUSO9Hdh90ixWxsWKk7gtoya.jpg','1994-06-20',5.4,0),(25645,'The Switch',