ish town, which awaits the imminent visit from a committee that will decide if they merit a local Business Excellence award: everything has to be perfect when the time comes. Working against the clock, Blanco pulls out all the stops to address and resolve issues with his employees, crossing every imaginable line in the process.','https://image.tmdb.org/t/p/w500/pe5ocuacrGvkEkyJg4IcQOycIt7.jpg','2021-10-15',7.1,0),(25651,'Who Finds a Friend Finds a Treasure','it','Alan gets a map to some war treasure which the Japanese army left behind on a small Pacific island at the end of World War II. But some gangsters try to steal the map from him and so he hides on Charlie\'s boat which just leaves the harbor. He manipulates the ship\'s compass so that Charlie is not aware that he is sailing to the treasure island. But when they step on the island, they discover that it is not as abandoned as they believed: there are some natives - and a Japanese soldier still defending the treasure','https://image.tmdb.org/t/p/w500/8fl6sXVv5fWMpDxFDab54qc71tv.jpg','1981-12-09',6.8,0),(25652,'The Sleepover','en','Two siblings who discover their seemingly normal mom is a former thief in witness protection. Mom is forced to pull one last job, and the kids team up to rescue her over the course of an action-packed night.','https://image.tmdb.org/t/p/w500/9iEc34Qje2V3FZnrSXKfZsbiHjW.jpg','2020-08-21',6.4,0),(25653,'Point of No Return','en','Hardened criminal Maggie Hayward\'s consistent violence, even in police custody, ends in the execution chamber. However, top-secret US government agent \'Bob\' arranges a staged death, so Maggie can be elaborately trained as a phantom killer and subdued into obedience.','https://image.tmdb.org/t/p/w500/ixWqZZMkTbLbcbCn9mJgSlCjQcg.jpg','1993-03-19',6.2,0),(25654,'The Sentinel','en','A secret service agent is framed as the mole in an assassination attempt on the president. He must clear his name and foil another assassination attempt while on the run from a relentless FBI agent.','https://image.tmdb.org/t/p/w500/a7Yv1Zzf3fhzDPJBXEejroPmdUV.jpg','2006-04-19',6,0),(25655,'The Last Thing He Wanted','en','At the turning point of the Iran-Contra affair, Elena McMahon, a fearless investigative journalist covering the 1984 US presidential campaign, puts herself in danger when she abandons her assigned task in order to fulfill the last wish of her ailing father, a mysterious man whose past activities she barely knows.','https://image.tmdb.org/t/p/w500/gItrnbEbMBbUrdIkFz8kgS2gkt.jpg','2020-02-14',4.9,0),(25656,'Wedding Unplanned','fr','When she discovers a wedding planer\'s business card, Alexia instantly says, \"YES\" to Mathias unaware that it belongs to his mistress. The groom is now trapped between his bride, and his lover who in charge of his unwanted marriage.','https://image.tmdb.org/t/p/w500/b9Xh6548vTyNhgTcWqFCE8MmdHv.jpg','2017-04-26',6.1,0),(25657,'Kim Possible: So the Drama','en','Dr. Drakken has an evil new plot for world domination, but his ultimate success depends upon finding out KP\'s weakness which may involve a new hottie at Middleton High School named Eric, who suddenly sparks feelings in Ron about Kim that resemble much more than friendship. To make matters worse, Bueno Nacho, Ron\'s favorite fast food chain has turned sour on him by bombarding him with little Devils','https://image.tmdb.org/t/p/w500/qoqt8Viw7vqVNV14g3YhSKjF7ta.jpg','2005-04-08',6.9,0),(25658,'Adiós','es','In Seville, Juan is starting to enjoy his weekends outside of prison when tragedy strikes: his little girl is killed in what looks like an accident.','https://image.tmdb.org/t/p/w500/A1pSmpQOexCjUQokW3JK4KSe9I7.jpg','2019-11-22',7.1,0),(25659,'Mayhem','en','A virus spreads through an office complex causing white collar workers to act out their worst impulses.','https://image.tmdb.org/t/p/w500/3M6SQXW3UsEtWGoBLQoqFBvLYP0.jpg','2017-11-10',6.5,0),(25660,'Bandits','en','After escaping from prison, Joe and Terry go on a crime spree, robbing banks through Oregon and California in order to finance their scheme for a new life south of the border. Unfortunately, things get more complicated when they meet Kate, who runs into them with her car. She joins the bandits on their cross-country spree, and eventually she steals something, too: their hearts.','https://image.tmdb.org/t/p/w500/67AUAkiT4rbgqN7SNlIJn0zWZqU.jpg','2001-10-12',6.3,0),(25661,'Hell Bent for Leather','en','When Clay Santell stops in the town of Sutterville after having his horse stolen, he is mistaken by townspeople for a murderer named Travers. The townspeople capture Santell, and turn him over to lawman Harry Deckett. Deckett, who is tired of chasing the real Travers, decides to kill Santell and pass him off as Travers. Santell escapes from Deckett, taking lovely Janet Gifford hostage in the process. Janet comes to believe Santell\'s story, and helps him in his struggle to prove his real identity.','https://image.tmdb.org/t/p/w500/rMBhOicw9PxTN1MMvpohBdAYlNB.jpg','1960-02-01',6.2,0),(25662,'Little Fish','en','A couple fights to hold their relationship together as a memory loss virus spreads and threatens to erase the history of their love and courtship.','https://image.tmdb.org/t/p/w500/8AYQ7vyUI2HVLEKH7niFvJ1AdZp.jpg','2021-02-05',7.1,0),(25663,'Bangkok Dangerous','en','When carrying out a hit, assassin Joe always makes use of the knowledge of the local population. On arriving in Bangkok, Joe meets street kid Kong and he becomes his primary aide. But when Kong is nearly killed, he asks Joe to train him up in the deadly arts and unwittingly becomes a target of a band of killers.','https://image.tmdb.org/t/p/w500/iTRftxHW8i4H7ONaOiCIwEXjNDJ.jpg','2008-08-21',5.2,0),(25664,'Beyond a Reasonable Doubt','en','Remake of a 1956 Fritz Lang film in which a novelist\'s investigation of a dirty district attorney leads to a setup within the courtroom.','https://image.tmdb.org/t/p/w500/uZvWmX3fhjnlIbiou5ziR6aVN7b.jpg','2009-02-05',5.7,0),(25665,'For Better And For Worse','fr','Jean has been the conservative mayor of a small town for several years. He intends to run for another term. Edith, his wife, is the paragon of the traditional devoted housewife and mother. So it comes as quite a shock when she tells her husband of forty years that deep down, she has always been... A MAN! Totally blindsided, Jean didn\'t see this coming. For a politician campaigning on family values, this is too much! But Edith, still the loving wife, make a deal with him: she will postpone her transition and stay a woman until after the elections. But as we know, campaigns are all about digging up dirt to keep the rumor mill turning','https://image.tmdb.org/t/p/w500/hxBJnMOfESBWV5lo6ZanL0rsECV.jpg','2023-02-15',0,0),(25666,'What\'s Love Got to Do with It','en','Singer Tina Turner rises to stardom while mustering the courage to break free from her abusive husband Ike.','https://image.tmdb.org/t/p/w500/oFAgqsmjPmwRP4dZqbe51HlpPIi.jpg','1993-06-09',7,0),(25667,'Emanuelle and Lolita','it','Another story about the adventures of a woman by the name of Emmanuel in exotic countries. This time in Sri Lanka, where young local lolita falls in love with luxurious white lady, causing the something like the parent and not only the feelings. But her friend was not against to have fun with a young aborigen...','https://image.tmdb.org/t/p/w500/tdHSguIS3quVJu8JEYRGWupRdP7.jpg','1978-01-01',3.9,0),(25668,'Wicked Little Things','en','Karen, Sarah, and Emma Tunney are all moving to a small town in Pennsylvania where, unknown to them, in 1913, a horrid mine accident trapped dozens of children alive, underground. But there\'s a problem. They\'re still alive.','https://image.tmdb.org/t/p/w500/wXymWZpjkeHUIi0G2YZYdcO1OH0.jpg','2006-11-17',5.8,0),(25669,'Bratz: Rock Angelz','en','After starting up their own teen magazine, Bratz girls Yasmin, Cloe, Jade, and Sasha fly to London to cover a rock concert.','https://image.tmdb.org/t/p/w500/9LJUOZgpiCs6r8uKj6bWY2Ja9uq.jpg','2005-09-13',6.1,0),(25670,'The Informers','en','A collection of intersecting short stories set in early 1980s Los Angeles, depicts a week in the lives of an assortment of socially alienated, mainly well-off characters who numb their sense of emptiness with casual sex, violence, and drugs.','https://image.tmdb.org/t/p/w500/g13vlYmgwQeT0sLIdUAY2Tal8J9.jpg','2008-11-05',4.7,0),(25671,'Well','hu','At a gas station in the middle of nowhere, a young man arrives to meet his father he hasn’t seen for 30 years. On the same day, a van with four prostitutes breaks down at the very same gas station, on the way to Switzerland. The three days they spend together in the station change their lives forever.','https://image.tmdb.org/t/p/w500/sKAvndrgPKBMOHNJTrKc1WRBoYu.jpg','2016-09-22',6.9,0),(25672,'Accidentally Engaged','en','When unsuccessful actress Clarissa returns to her hometown for a wedding and tries to impress her old friends by claiming she\'s dating big time celebrity Chas Hunter, she suddenly finds herself in a comically false engagement when her lies go public and Chas decides to join the festivities in a stunt to escape bad press.','https://image.tmdb.org/t/p/w500/lArOsPsD5e0W0paC7vReirclHNw.jpg','2016-03-05',6.3,0),(25673,'Uncanny Annie','en','On Halloween night a group of college students get trapped in a mysterious board game that brings their darkest secrets and fears to life, where they must play to escape…and win to survive.','https://image.tmdb.org/t/p/w500/ofJTmVJb3Wz55xkkGeEcIYWQlgS.jpg','2019-10-04',6.2,0),(25674,'Desapega!','pt','Rita must learn to deal with her increased shopping compulsion after the news that her daughter wants to leave.','https://image.tmdb.org/t/p/w500/wOoLkqjFbTt4Dok3bFkdqaIcv88.jpg','2023-02-09',0,0),(25675,'Made in Italy','en','A bohemian artist travels from London to Italy with his estranged son to sell the house they inherited from his late wife.','https://image.tmdb.org/t/p/w500/dKjD3DTZjRI3Ipkf7Oz5zAILnwD.jpg','2020-07-09',6,0),(25676,'Two by Two: Overboard!','en','The Honeymoon is over… How we enjoyed the party when our amphibious Nestrian chums discovered their incredible newfound agility underwater! But, when we revisit our curious, loveable pals, the entire animal kingdom’s survival is once again at stake. Amid the prospect of no new land on which to live and prosper, not to mention the ever-diminishing food resources, the mood on board the Ark is laden with mounting tensions, which regularly spill over into ark rage. Fragile peace is frequently broken with general chaos ensuing. How can our unlikely heroes help? And what lies beneath for Finny in an oceanful of possibilities when he quite literally falls into some rather surprising new company?','https://image.tmdb.org/t/p/w500/ckcn7tYzqVUABxMZhqHUbaSeLKf.jpg','2020-09-24',7.6,0),(25677,'Napoleon Dynamite','en','A listless and alienated teenager decides to help his new friend win the class presidency in their small western high school, while he must deal with his bizarre family life back home.','https://image.tmdb.org/t/p/w500/g5PAKdu5aolXMnIRFkCo6vXq5Jh.jpg','2004-06-11',6.8,0),(25678,'Before and After','en','Two parents deal with the effects when their son is accused of murdering his girlfriend.','https://image.tmdb.org/t/p/w500/oK8UKDrjFS14OFoihaQPfmmMOyI.jpg','1996-02-23',6,0),(25679,'Earth and Blood','fr','A sawmill owner and his teenage daughter become tangled in a deadly feud when a drug dealer stashes stolen cocaine on their remote property.','https://image.tmdb.org/t/p/w500/23S0NEXXOMhhXhF566Pw5sx7hnZ.jpg','2020-04-17',6.2,0),(25680,'Aurora Teagarden Mysteries: Haunted By Murder','en','A murder investigation is reignited in a house that is considered haunted by the Lawrenceton locals and where years ago Aurora and Sally, as teenagers, discovered a body.','https://image.tmdb.org/t/p/w500/76U8bHFPFXgfsdqLNOuNOzTk5tA.jpg','2022-02-20',7.1,0),(25681,'Tesla','en','The story of the Promethean struggles of Nikola Tesla, as he attempts to transcend entrenched technology—including his own previous work—by pioneering a system of wireless energy that would change the world.','https://image.tmdb.org/t/p/w500/v0guO0krvyz8IfKGxEje04LVM9d.jpg','2020-08-14',5.9,0),(25682,'Yi Yi','zh','Each member of a family in Taipei asks hard questions about life\'s meaning as they live through everyday quandaries. NJ is morose: his brother owes him money, his mother is in a coma, his wife suffers a spiritual crisis when she finds her life a blank and his business partners make bad decisions.','https://image.tmdb.org/t/p/w500/hTPkCpK9SLGDMXRbUwzoep0MxOx.jpg','2000-09-20',7.9,0),(25683,'1BR','en','When Sarah lucks into a sweet one-bedroom at Asilo Del Mar Apartments in Los Angeles, she thinks she\'s hit the jackpot. It\'s got plenty of space, friendly tenants, group BBQs and even a cute neighbour next door. All is not what it seems: loud noises start keeping her awake at night; her cat is missing; everyone seems to be a little too helpful and friendly, except for the weirdo, Lester. Soon, Sarah learns she didn\'t choose this apartment — it chose her.','https://image.tmdb.org/t/p/w500/aiYLasUoJXqOgJ9pnahDMELC9wf.jpg','2019-07-18',6.1,0),(25684,'Robin Williams: Come Inside My Mind','en','A funny, intimate and heartbreaking portrait of one of the world’s most beloved and inventive comedians, Robin Williams, told largely through his own words. Celebrates what he brought to comedy and to the culture at large, from the wild days of late-1970s L.A. to his death in 2014.','https://image.tmdb.org/t/p/w500/ak9DZnzInl9oIUlXxsFsUd37ueh.jpg','2018-01-19',7.9,0),(25685,'Mother\'s Day','en','Intersecting stories with different moms collide on Mother\'s Day.','https://image.tmdb.org/t/p/w500/AvGTqWgDjQ0TwDkApFMAA1BxJOD.jpg','2016-04-28',6,0),(25686,'Rubber','en','A group of people gather in the California desert to watch a \"film\" set in the late 1990s featuring a sentient, homicidal car tire named Robert. The assembled crowd of onlookers watch as Robert becomes obsessed with a beautiful and mysterious woman and goes on a rampage through a desert town.','https://image.tmdb.org/t/p/w500/wRq1hopdaZCltQa6IdZT8OtO3Vm.jpg','2010-11-09',6,0);
